            //Descriptions
            ["id" => "c5b8f531-5393-464c-93c7-16f3e5e91051", "translation" => "The Church of Saint-Cyprien in El Kala is a remarkable religious building and an architectural and spiritual testament to the history and cultural richness of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "70de6341-675e-4025-bcb9-0912c6cfb278", "translation" => "L'église Saint-Cyprien d'El Kala est un édifice religieux remarquable. et un témoignage architectural et spirituel de l'histoire et de la richesse culturelle de la région", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b863e3f1-efd5-408a-81fc-cfc21a072145", "translation" => "تعد كنيسة القديس سيبريان في القالة مبنى دينيًا رائعًا. وشهادة معمارية وروحية على تاريخ المنطقة وثرائها الثقافي", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //2
            ["id" => "296bfe64-7adb-4d86-a813-06d23d735c19", "translation" => "The Moulin Fort is a fascinating historical site. Located in the town of El Kala, this fort provides insight into the region's tumultuous past. With its sturdy stone walls and defensive towers, it boasts robust and imposing architecture. Not to mention the panoramic views from the ramparts that provide a magnificent spectacle of the surroundings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "eb3e9900-ed92-4e0e-a3fd-1c34bdb55819", "translation" => "Le Fort Moulin est un site historique fascinant. Situé dans la ville d'El Kala, ce fort offre un aperçu du passé tumultueux de la région. Avec ses murs solides en pierre et ses tours de défense, il présente une architecture robuste et imposante. Sans oublier les vues panoramiques depuis les remparts qui offrent un spectacle magnifique sur les environs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d40db377-5707-44d0-ac2a-aa98b52841e4", "translation" => "قلعة مولان هي موقع تاريخي رائع. تقع في مدينة القالة، وتقدم هذه القلعة نظرة على الماضي العريق للمنطقة. بجدرانها الصلبة المبنية من الحجر وأبراجها الدفاعية، تقدم هندسة متينة ومهيبة. دون نسيان المناظر البانورامية من الأسوار التي تقدم منظرًا رائعًا للمناطق المحيطة بها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //3
            ["id" => "009b111c-bce3-4100-a791-0c7592c41d1d", "translation" => "The Brabtia zoological park is an ideal place for a family day out, offering both an educational experience, interaction with animals, and fun water activities. It's a place where you can connect with nature and learn more about the diversity of animal life while having an enjoyable and entertaining time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b3bbcda2-bac6-4c38-9d69-701933439d11", "translation" => "Le parc zoologique de Brabtia est un lieu idéal pour une journée en famille, offrant à la fois une expérience éducative, une interaction avec les animaux et des activités aquatiques amusantes. C'est un endroit où l'on peut se connecter à la nature et en apprendre davantage sur la diversité de la vie animale tout en passant un moment agréable et divertissant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e5e7d5fb-6c2d-4960-9499-95351b627110", "translation" => "حديقة الحيوانات برابطية هي مكان مثالي لقضاء يوم مع العائلة، حيث تقدم تجربة تعليمية، تفاعل مع الحيوانات، وأنشطة مائية ممتعة. إنها مكان يمكنك فيه التواصل مع الطبيعة والتعرف على المزيد عن تنوع الحياة الحيوانية بينما تقضي وقتًا ممتعًا ومسليًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //4
            ["id" => "dc7ba502-6aed-46f5-bbf1-0abc79d60b7b", "translation" => "Lake Mellah is a breathtaking natural wonder. This lake offers a picturesque landscape surrounded by lush vegetation. Its calm waters reflect the beauty of its natural surroundings. The shores of Lake Mellah are lined with green trees and a variety of aquatic plants, creating a biodiversity-rich ecosystem.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4eb6478f-81a3-45cf-a6bc-fa5cfe75267e", "translation" => "Le lac Mellah est une merveille naturelle à couper le souffle. Ce lac offre un paysage pittoresque entouré d'une végétation luxuriante. Ses eaux calmes reflètent la beauté de son environnement naturel. Les rives du lac Mellah sont bordées d'arbres verdoyants et d'une variété de plantes aquatiques, créant un écosystème riche en biodiversité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ae9a614a-0eb1-41bb-b4d8-454c4960effa", "translation" => "بحيرة ملاح هي عجب طبيعي يأسر الألباب. تقدم هذه البحيرة منظرًا خلابًا محاطًا بنبات غني. مياهها الهادئة تعكس جمال بيئتها الطبيعية. يتميز شاطئ بحيرة ملاح بأشجار خضراء ومجموعة متنوعة من النباتات المائية، مما يخلق نظامًا بيئيًا غنيًا بالتنوع البيولوجي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //5
            ["id" => "9e6c826a-1233-4f7e-99e2-59a271e97238", "translation" => "Lake Tonga is a natural gem of great beauty. This enchanting lake offers deep blue waters surrounded by breathtaking landscapes. Visitors can also explore the lake's surroundings by taking hiking trails that offer panoramic views of the surrounding nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3db36488-c955-4db1-94dc-e8b3ee1952ec", "translation" => "Le lac Tonga est un joyau naturel d'une grande beauté. Ce lac enchanteur offre des eaux d'un bleu profond entourées de paysages à couper le souffle. Les visiteurs peuvent également explorer les environs du lac en empruntant des sentiers de randonnée offrant des vues panoramiques sur la nature environnante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f5d0b06f-7b9f-4f44-82d8-34de924d6623", "translation" => "بحيرة تونغا هي جوهرة طبيعية جميلة. تقدم هذه البحيرة الساحرة مياهًا زرقاء عميقة محاطة بمناظر خلابة. يمكن للزوار أيضًا استكشاف محيط البحيرة من خلال مسارات المشي لمسافات طويلة التي تقدم مناظر بانورامية للطبيعة المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //6
            ["id" => "cc69c5f3-7b50-4354-91fa-b46a7cc401fa", "translation" => "The Cap Rosa Lighthouse is an iconic landmark on the coast. With its slender structure and stone tower, it offers breathtaking panoramic views of the surrounding seascape. Despite the passage of time, it remains an essential element of the region's coastal landscape, bearing witness to maritime history and providing an unforgettable visual experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "98de9ded-3f59-4a5b-af01-04280bd1af66", "translation" => "Le Phare de Cap Rosa est un repère emblématique sur la côte. Avec sa structure élancée et sa tour en pierre, il offre une vue panoramique imprenable sur les environs marins. Il reste malgré le passage du temps un élément essentiel du paysage côtier de la région, témoignant de l'histoire maritime et offrant une expérience visuelle inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c0e93679-7080-45ba-b76a-54b518460e89", "translation" => "منارة كاب روزا هي معلم بارز على الساحل. بفضل هيكلها النحيل وبرجها الحجري، توفر إطلالات بانورامية رائعة على المناظر البحرية المحيطة. على الرغم من مرور الزمن، إلا أنها تظل عنصرًا أساسيًا في مناظر الساحل في المنطقة، مشهدًا لتاريخ الملاحة وتوفير تجربة بصرية لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //7
            ["id" => "80870dee-3dc0-4e85-bead-cc8b4910b72b", "translation" => "Lake Oubeira is a natural treasure of great beauty. It is also a refuge for many species of migratory birds, offering ornithology enthusiasts a unique experience. It is an ideal place to relax, connect with nature, and admire the tranquil beauty of this enchanting lake.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "353180c6-4027-4bd1-8f14-9c459e69d917", "translation" => "Le lac Oubeira est un trésor naturel d'une grande beauté. Il est également un refuge pour de nombreuses espèces d'oiseaux migrateurs, offrant aux amateurs d'ornithologie une expérience unique. C'est un lieu idéal pour se détendre, se connecter avec la nature et admirer la beauté tranquille de ce lac enchanteur.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6f8da866-4462-4bc0-ab58-0352d938d424", "translation" => "بحيرة أوبيرا هي كنز طبيعي من الجمال الكبير. إنها أيضًا مأوى للعديد من أنواع الطيور المهاجرة، مما يقدم لهواة علم الطيور تجربة فريدة. إنه مكان مثالي للاسترخاء والاتصال بالطبيعة والتمتع بجمال هذه البحيرة الساحرة و المستريحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //8
            ["id" => "c5f16d86-efc5-47ae-83d9-8ed60c1f3edf", "translation" => "The El Kala Lighthouse is an iconic structure that guides mariners along the coast. Located in the town of El Kala, it fulfills its crucial role in maritime navigation.In addition to its practical function, the lighthouse is also a tourist attraction, offering visitors the opportunity to enjoy spectacular views of the ocean and coastal landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "80cf0b50-914d-414e-b419-dcebff9242fa", "translation" => "Le phare d'El Kala est une structure emblématique qui guide les navigateurs le long de la côte. Situé dans la ville d'El Kala. Il remplit ainsi son rôle crucial dans la navigation maritime. En plus de sa fonction pratique, le phare est également un attrait touristique, offrant aux visiteurs la possibilité de profiter de vues spectaculaires sur l'océan et les paysages côtiers.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a0f96d78-b668-426c-bca8-68ef580153b9", "translation" => "منارة القالة هي هيكل أيقوني يوجه الملاحين على طول الساحل. تقع في مدينة الكالة، وتؤدي دورها الحاسم في الملاحة البحرية. بالإضافة إلى وظيفتها العملية، تعتبر المنارة أيضًا معلمًا سياحيًا، حيث تقدم للزوار فرصة التمتع بمناظر خلابة للمحيط والمناظر الساحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //9
            ["id" => "0a3d287c-79e0-466d-908e-cd38b749a695", "translation" => "The Guergour Forest is a true natural treasure. It is home to a diverse range of wildlife, including bird species, mammals, and reptiles, providing nature enthusiasts with exceptional observation opportunities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c78aa17b-4216-4dbc-ab4a-57814a7aed43", "translation" => "La forêt de Guergour est un véritable trésor naturel. Elle abrite une faune variée, avec des espèces d'oiseaux, de mammifères et de reptiles, offrant ainsi aux amoureux de la nature des opportunités d'observation exceptionnelles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "59bf4f5b-3606-43f5-b6c5-977b017d7ad5", "translation" => "غابة الڤرڨور كنز طبيعي حقيقي. إنها موطن لمجموعة متنوعة من الحياة البرية، بما في ذلك أنواع الطيور والثدييات والزواحف، مما يوفر لعشاق الطبيعة فرصًا استثنائية للمشاهدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //10
            ["id" => "9a4f7a9a-0399-4ec9-bfc8-500f3d3ee81e", "translation" => "This archaeological site offers visitors a unique opportunity to explore the remains of the Roman and Byzantine eras, as well as to learn more about the history and culture of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ffaf8a68-aca6-48c2-870c-9253004c46ce", "translation" => "Ce site archéologique offre aux visiteurs une occasion unique de découvrir les vestiges de l'époque romaine et byzantine, ainsi que d'en apprendre davantage sur l'histoire et la culture de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a7265697-a38a-4dcd-aa18-183e32dfb3d4", "translation" => "هذا الموقع الأثري يقدم للزوار فرصة فريدة لاكتشاف آثار العصور الرومانية والبيزنطية، بالإضافة إلى تعرفهم على تاريخ وثقافة المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //11
            ["id" => "a9c53f05-216f-450a-a1d5-4fab770bad3d", "translation" => "El Kala National Park offers an exceptional diversity of landscapes, ranging from lush forests to beaches and mountains. It is home to an incredible wealth of biodiversity, including a variety of flora and fauna, including rare and endemic species.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bb0913f9-2e00-4fbd-b541-f7703fc7cae7", "translation" => "Le parc national d'El Kala offre une diversité exceptionnelle de paysages, allant des forêts verdoyantes aux plages en passant par les montagnes. Il abrite une richesse incroyable de biodiversité, avec une flore et une faune variées, y compris des espèces rares et endémiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "67989de5-8cc0-40c6-8a3b-926f976f20f7", "translation" => "الحظيرة الوطنية للقالة تقدم تنوعًا استثنائيًا من المناظر الطبيعية، بدءًا من الغابات الخضراء وصولاً إلى الشواطئ والجبال. إنها موطن لثروة لا تصدق من التنوع البيولوجي، بما في ذلك تشكيلة متنوعة من النباتات والحيوانات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //12
            ["id" => "dbeb85a3-70d2-4857-a87e-8cc1091114cb", "translation" => "The open-air theater of El Kala is an enchanting artistic venue located by the sea. This unique cultural space offers a captivating theatrical experience in a spectacular natural setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a39d387a-c36d-47ff-bc0b-c0ce81f05211", "translation" => "Le théâtre en plein air d'El Kala est un lieu artistique enchanteur situé en bord de mer. Cet espace culturel unique offre une expérience théâtrale captivante dans un cadre naturel spectaculaire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "713c47fb-7704-4eb2-b22e-62596554183b", "translation" => "مسرح الهواء الطلق في القالة هو مكان فني ساحر يقع على شاطئ البحر. يقدم هذا المكان الثقافي الفريد تجربة مسرحية جذابة في إطار طبيعي رائع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //13
            ["id" => "ce276aa6-626b-4f34-b9e0-ebc3aedb283f", "translation" => "The July 5th Garden, located in the city center, is a small green oasis in the midst of urban hustle and bustle. The benches scattered throughout the garden invite visitors to sit down and enjoy the beauty of the surroundings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1b632f5c-2b3f-45fb-8317-4b9d8654281e", "translation" => "Le jardin du 5 juillet, en plein centre-ville est un petit havre de verdure au cœur de l'agitation urbaine. Les bancs disséminés dans le jardin invitent les visiteurs à s'asseoir et à profiter de la beauté de l'environnement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e4671778-6ca7-4647-a9a8-0a71b3aeb34d", "translation" => "حديقة الخامس من جويلية الموجودة في وسط المدينة، هي ملاذ صغير من الخضرة في قلب صخب المدينة. المقاعد المبعثرة في الحديقة تدعو الزوار للجلوس والاستمتاع بجمال المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //14
            ["id" => "dea43688-0273-47f3-8215-486cb2385595", "translation" => "The Bastion de France is considered one of the most important and famous archaeological sites in the El Tarf province. In short, it's a place rich in history that allows visitors to immerse themselves in the region's significant cultural heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d6c9b488-4a69-4036-8ef1-1b4a09dd7f21", "translation" => "Bastion de France est considérée comme l'un des sites archéologiques les plus importants et les plus célèbres de la wilaya d'El Tarf. En bref, un lieu chargé d'histoire qui permet aux visiteurs de se plonger dans le patrimoine culturel important de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "83cb5499-4cf8-4234-890a-65fc35c657e7", "translation" => "قلعة فرنسا يُعَد واحدًا من أهم وأشهر المواقع الأثرية في ولاية الطارف. إنه مكان غني بالتاريخ يسمح للزوار بالانغماس في التراث الثقافي المهم للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //15
            ["id" => "5e135ba4-8e5d-46f6-b5dc-76e2ea1262fd", "translation" => "The Bird Lake is a freshwater pond that harbors exceptional biodiversity. Despite its relatively small size compared to other lakes in the region, it hosts thousands of waterfowl every year, gathering on these ponds to offer a superb spectacle.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3544b71a-4037-40d4-9259-cac056461a22", "translation" => "Le lac des Oiseaux est un étang d’eau douce qui abrite en son sein une biodiversité exceptionnelle, malgré sa dimension relativement réduite en comparaison avec les autres lacs de la région, il accueille des milliers d’oiseaux d’eau chaque année qui se rassemblent sur ces étangs pour offrir un spectacle superbe.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e45ae4f2-2a02-4d8e-bcd4-4cd063e9c1d8", "translation" => "بحيرة الطيور هي بركة مياه عذبة تضم تنوعًا استثنائيًا من الحياة البرية. على الرغم من حجمها الصغير نسبياً مقارنة بالبحيرات الأخرى في المنطقة، إلا أنها تستضيف آلاف الطيور المائية كل عام، حيث يتجمعون على هذه البرك لتقديم عرض رائع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //16
            ["id" => "16bf32fa-b132-4ee8-bf30-04f2eab31840", "translation" => "Whether you want to relax on the golden sand or enjoy water activities, Messida Beach has everything to satisfy visitors' expectations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a61be086-d0f0-4268-89ac-bd59ef01fde6", "translation" => "Que vous souhaitiez vous détendre sur le sable doré ou profiter des activités nautiques, la plage de Messida a tout ce qu'il faut pour satisfaire les attentes des visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f63b7f7d-0d8c-4dc2-9a7f-f0df92ca1d65", "translation" => "سواء كنت ترغب في الاسترخاء على الرمال الذهبية أو الاستمتاع بالأنشطة المائية، شاطئ مسيدة يحتوي على كل ما يلبي توقعات الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //17
            ["id" => "65377076-2499-415d-8b2d-b0bf6f3b1ac6", "translation" => "The Old Port of El Kala is a place steeped in history and charm that dates back to the Phoenician and Berber civilizations, where commercial counters stretched along the entire gulf. It is a lively and picturesque place that reflects the maritime essence of El Kala.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "033650cc-6b41-4b6f-b935-71c309dfb5db", "translation" => "Le Vieux Port d'El Kala est un endroit empreint d'histoire et de charme qui remonte aux civilisations phénicienne et berbère, où les comptoirs commerciaux s'étendaient tout le long du golfe.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ecd1da90-c5c7-4227-874f-d29feb1577f3", "translation" => "الميناء القديم في القالة هو مكان تاريخي يعود إلى الحضارات الفينيقية والبربرية، حيث امتدت الأسواق التجارية على طول الخليج بأكمله. إنه مكان حيوي وجميل يعكس جوهر البعد البحري للقالة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //18
            ["id" => "ac13646b-b285-4020-b402-5ac8fa987594", "translation" => "Opened in 2015, the new fishing port is a dynamic hub of activity where the fishing industry thrives and fishermen can benefit from modern facilities for their daily operations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "09b07b0c-12e2-4b75-9359-16f733908cee", "translation" => "Inauguré en 2015, Le nouveau port de pêche est un centre d'activité dynamique où l'industrie de la pêche prospère et où les pêcheurs peuvent bénéficier d'installations modernes pour leurs opérations quotidiennes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "86973b27-331c-4995-8733-4b5c6da40ae6", "translation" => "تم افتتاح الميناء الجديد للصيد في عام 2015، وهو مركز نشاط ديناميكي حيث تزدهر صناعة الصيد ويمكن للصيادين الاستفادة من مرافق حديثة لعملياتهم اليومية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //19
            ["id" => "a223a990-42bb-43e5-85aa-6ff5ca34e686", "translation" => "El Mordjane beach is one of the oldest authorized swimming beaches in El Tarf. Located in the city center of El Kala, it is considered by locals to be the ultimate family beach in the region. With its beautiful enchanting landscapes and clear sea, you will be quickly captivated.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "32dc6372-76a1-4a9e-9713-e47445f6964c", "translation" => "Plage El Mordjane est l'une des plus anciennes plages autorisées à la baignade à El Tarf, située au centre-ville d'El Kala, elle est selon les locaux la plage familiale par excellence dans la région, avec ses beaux paysages féeriques, sa mer limpide, vous serez vite conquis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ddf99ffd-ef6f-4154-826f-960f8c03af31", "translation" => "شاطئ المرجان هو واحد من أقدم الشواطئ المسموح فيها بالسباحة في الطارف, يقع في وسط مدينة القالة. وفقًا للسكان المحليين، فإنه يُعتبر الشاطئ العائلي الأمثل في المنطقة، حيث يقدم مناظر طبيعية خلابة وبحراً صافياً.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //20
            ["id" => "96996822-623a-4f58-8936-68716cbbecf1", "translation" => "The beach, sublime and enchanting, is a true natural postcard that encourages visitors to linger, explore, and discover its ancient remains and secrets, including ancient ovens that tell the history of this region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8adc59ad-58e6-4144-bfd1-bca687a9bfee", "translation" => "La plage, sublime et envoûtante, est une véritable carte postale naturelle incitant les visiteurs à s’y attarder, à la sillonner et y découvrir ses anciens vestiges et secrets, dont des fours antiques relatant l’histoire de cette région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "54225f5e-e3aa-446c-97b6-fc635de001f7", "translation" => "شاطئ القالة القديمة، ساحر، هو بطاقة بريدية طبيعية حقيقية تشجع الزوار على البقاء واستكشافها واكتشاف بقاياها القديمة واسرارها، بما في ذلك أفران قديمة تروي تاريخ هذه المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //21
            ["id" => "5c4b7b19-cf8c-47aa-ac90-f35ca6e312c2", "translation" => "A perfect combination of fine sand and crystal-clear water. The gentle waves invite you to swim and enjoy aquatic pleasures. The stretches of golden sand provide an ideal space for relaxation and sunbathing.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "77417309-0c33-4d6d-8d25-e494d6df8a5e", "translation" => "Une combinaison parfaite de sable fin et d'eau cristalline. Les douces vagues invitent à la baignade et au plaisir aquatique. Les étendues de sable doré offrent un espace idéal pour se détendre et bronzer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4e8a9a76-4545-41c3-8ff6-be9ccf426630", "translation" => "مزيج مثالي من الرمال الناعمة والمياه الصافية البلورية. الأمواج اللطيفة تدعو للسباحة والاستمتاع في الماء. الشواطئ الممتدة من الرمال الذهبية توفر مساحة مثالية للاسترخاء واحتساء الشمس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //22
            ["id" => "2da0a0d0-a886-4e6e-ac29-54f3bc4c3cfe", "translation" => "Located not far from Messida Beach, Laouinette enjoys an equally paradisiacal panorama with its crystal-clear waters and light sand, making it one of the most popular beaches in the entire region. It also has a guarded parking area.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b610ce26-ff13-4f7b-9dee-e8b5cfe82c8a", "translation" => "Située non loin de la plage Messida, Laouinette bénéficie d’un panorama tout aussi paradisiaque avec ses eaux cristallines et son sable clair, elle fait partie des plages les plus prisées de toute la région. Elle dispose également d’un parking gardé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0bc9f0f8-c23c-4fbf-9dc0-bbdbc1eb5ad9", "translation" => "يقع شاطئ لعوينات بالقرب من شاطئ مسيدة ويتمتع بمنظر طبيعي جميل مع مياهه الصافية ورماله الفاتحة. كما أنه يحتوي على موقف سيارات محروس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //23
            ["id" => "bc677e0b-87c5-4527-8297-8cd946dc6de6", "translation" => "Due to its isolation and difficult access, Boutribicha Beach offers a calm and intimate atmosphere, perfect for escaping the hustle and bustle of daily life. Here, you can enjoy absolute tranquility, far from the crowds and mass tourism.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a58cb551-2ec7-4e87-954d-f5abea8a6680", "translation" => "En raison de son isolement et de sa difficulté d'accès, la plage de Boutribicha offre une atmosphère calme et intime, idéale pour échapper à l'agitation de la vie quotidienne. Vous pourrez profiter d'une tranquillité absolue, loin de la foule et du tourisme de masse.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e4c4194d-40fe-4116-ad43-422235cd8397", "translation" => "بسبب عزلتها وصعوبة الوصول إليها، تقدم شاطئ بوطريبيشة جوًا هادئًا وحميمًا، مثاليًا للهروب من صخب الحياة اليومية. هنا، يمكنك الاستمتاع بالهدوء التام، بعيدًا عن الزحام والسياحة الجماعية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //24
            ["id" => "9104ee44-a026-4cbd-acc9-5fd46b713adb", "translation" => "This beach is a true haven of peace where you can rejuvenate while enjoying the sun, the sea, and the preserved natural beauty of the coast.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "906a5407-b575-45d4-9740-91edb152f967", "translation" => "La plage est un véritable havre de paix où l'on peut se ressourcer en profitant du soleil, de la mer et de la beauté naturelle préservée de la côte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "043d0710-2e58-4c82-8929-544863391ea7", "translation" => "هذا الشاطئ هو ملاذ حقيقي للسلام حيث يمكنك أن تستعيد نشاطك وتتمتع بالشمس والبحر وجمال الطبيعة الحية على الساحل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //25
            ["id" => "2776bea2-a0be-4343-a860-332a605f6608", "translation" => "A long stretch of fine sandy beach, typically uncrowded and quickly transforming into a true haven where one can reconnect with nature, rejuvenate, and enjoy unforgettable moments by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b52d88c4-1b36-464c-acbc-744145166d11", "translation" => "Longue plage de sable fins, généralement peu fréquentée et qui peut rapidement se transformer en un véritable refuge où l'on peut se reconnecter avec la nature, se ressourcer et profiter de moments inoubliables au bord de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0114d3bd-0713-4c06-a2b8-477aee739b2b", "translation" => "شاطئ طويل من الرمال الناعمة، عادةً غير مكتظ ويمكن أن يتحول بسرعة إلى ملاذ حقيقي حيث يمكن للشخص أن يعيد الاتصال مع الطبيعة ويتجدد ويستمتع بلحظات لا تُنسى على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //26
            ["id" => "7f5fb324-0a6d-44f0-92f1-b6001e725738", "translation" => "Segleb Beach offers a unique landscape, with its imposing and wild rock formations that stretch along the shore. Sunsets on the rocky beach provide breathtaking panoramas, with rocks that beautifully contrast with the colorful sky. It's an ideal spot for nature lovers seeking a unique coastal experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "88f09a1c-3d70-4a19-8f2c-476a578c635a", "translation" => "La plage Segleb offre un paysage unique, avec ses formations rocheuses imposantes et sauvages qui s'étendent le long du rivage. Les couchers de soleil sur la plage rocheuse offrent des panoramas époustouflants, avec des rochers qui contrastent magnifiquement avec le ciel coloré. C'est un endroit idéal pour les amoureux de la nature à la recherche d'une expérience côtière unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3713dcf7-1590-4dcb-ac0c-76fd764a50bf", "translation" => "شاطئ سيغلب يقدم مناظر طبيعية فريدة من نوعها، مع تضاريس صخرية مهيبة وبرية تمتد على طول الشاطئ. يوفر غروب الشمس على الشاطئ الصخري مناظر بانورامية رائعة، مع صخور تتناغم بشكل جميل مع السماء الملونة. إنه مكان مثالي لعشاق الطبيعة الذين يبحثون عن تجربة ساحلية فريدة من نوعها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //27
            ["id" => "08f791b4-b62a-45bf-9d28-56b11c66f9dd", "translation" => "The basilica of Saint Augustine is a magnificent religious structure in the neo-byzantine style and a must-visit for all visitors to Annaba, whether you are history or architecture enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e1dd4737-99c3-4316-bb09-b85547dd9279", "translation" => "La basilique Saint Augustin est une magnifique structure religieuse de style néo-byzantin et un lieu incontournable pour tous les visiteurs d’Annaba, les amateurs d’histoire ou d’architecture.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b55b5117-7a45-4c63-aab3-173ef9c82ec7", "translation" => "بازيليكا القديس أوغسطينوس هي هيكل ديني رائع بأسلوب النيو بيزنطي وهي مكان لا غنى عنه لجميع زوار عنابة، سواء كنت من عشاق التاريخ أو الهندسة المعمارية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //28
            ["id" => "d3ada423-c734-4238-be08-773733f717a1", "translation" => "The ruins of Hippone are of great archaeological value: the residential district, from which most of the mosaics originate, the Christian quarter where the basilica is located, the marketplace, the large baths, and the forum.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "755e4379-24a6-49e0-84bf-65c7582e5d04", "translation" => "Les ruines d’Hippone sont d’une grande valeur archéologique : le quartier résidentiel d’où proviennent la plupart des mosaïques, le quartier chrétien où se trouve la basilique,la place du marché, les grands thermes ou encore le forum.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b620945f-7916-4486-a193-2128de772a04", "translation" => "أثار رومانية هيبون هي ذات قيمة كبيرة: حي السكني، منهج الكثير من الفسيفساء، الحي المسيحي حيث يقع البازيليكا ، ساحة السوق، الحمامات الكبيرة، والمنتدى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //29
            ["id" => "8a61165a-deec-48b7-a38b-b294da213682", "translation" => "The museum of Hippone is a fascinating place that houses the historical remains of the ancient Roman civilization. Visitors can admire fragments of buildings, sculptures, and artifacts that have survived through the centuries. The information and exhibits provide a captivating insight into the Roman history of Annaba.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d22d5973-f0ee-4347-aa7a-9276ecca8517", "translation" => "Le musée d’Hippone est un lieu fascinant qui abrite les vestiges historiques de l'ancienne civilisation romaine.Les visiteurs peuvent admirer des fragments de bâtiments, des sculptures et des artefacts qui ont survécu à travers les siècles. Les informations et les expositions fournissent un aperçu captivant de l'histoire romaine d’Annaba", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6c8d0b53-ddad-4dc1-b132-0757194890f3", "translation" => "متحف هيبون هو مكان رائع يضم الآثار التاريخية للحضارة الرومانية القديمة. يمكن للزوار أن يعجبوا بشظايا المباني والنحت والأصناف التي نجت عبر القرون. توفر المعلومات والعروض نظرة مثيرة على التاريخ الروماني لمدينة عنابة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //30
            ["id" => "4117ebc8-dc36-4947-8fbc-f65dc9eb32b4", "translation" => "The Revolution square is a public thoroughfare nearly a kilometer long and following the city's historical axis, serving as a central traffic artery. Today, it is one of the busiest and liveliest places in Annaba.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a1667e38-5adf-44f5-9b76-96e3fc3afcd2", "translation" => "Le cours de la révolution est une voie publique longue de près d'un kilomètre et suivant l'axe historique de la ville, une voie de circulation centrale. Le cours de la révolution est aujourd'hui l'un des lieux les plus fréquentés et animés d'Annaba.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "15d71f61-4502-464a-ab64-e2e4d57430ee", "translation" => "ساحة الثورة هي طريق عام يمتد على مقربة من كيلومتر واحد تقريبًا ويتبع المحور التاريخي للمدينة، وهو شريان حيوي لحركة المرور المركزية. في الوقت الحالي، تُعد ساحة الثورة واحدة من أكثر الأماكن ازدحامًا حيوية في عنابة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //31
            ["id" => "c69e76b3-c02b-4cfa-8adc-244a97449a3f", "translation" => "The place d'Armes is a lively and iconic central square in the city. Surrounded by historic buildings, the square is a popular gathering spot for both residents and visitors, where one can enjoy the vibrant atmosphere and observe daily life. Cafés, restaurants, and shops line the square, providing a variety of options for relaxation and dining.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8e394beb-af42-45dc-a908-1460bbcb15c5", "translation" => "La place d'Armes est une place centrale animée et emblématique de la ville. Entourée de bâtiments historiques. La place est un lieu de rassemblement populaire pour les habitants et les visiteurs, où l'on peut profiter de l'atmosphère animée et observer la vie quotidienne. Des cafés, des restaurants et des commerces bordent la place, offrant une variété d'options pour se détendre et se restaurer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "08cfcfb1-6d2d-45f5-b1a5-41afc5cd3ed3", "translation" => "ساحة السلاح هي ساحة مركزية حية ورمزية في المدينة. محاطة بالمباني التاريخية، تعتبر الساحة مكانًا شعبيًا للتجمعات سواء بالنسبة للمقيمين أو الزوار، حيث يمكن للزائرين الاستمتاع بالأجواء النابضة بالحياة ومشاهدة الحياة اليومية. يتخلل الساحة مقاهي ومطاعم ومحلات تجارية، مما يوفر مجموعة متنوعة من الخيارات للاسترخاء وتناول الطعام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //32
            ["id" => "7919e68f-6aac-47f4-b3ee-ee9d5f8638a6", "translation" => "The 'Mohamed Boudiaf' palace of culture offers a rich and diverse program of artistic events, including art exhibitions, theatrical performances, concerts, lectures, and workshops.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ae5cf150-5048-4903-a4ff-1491a12efae8", "translation" => "Le palais de la culture «Mohamed Boudiaf» propose une programmation riche et diversifiée d'événements artistiques, tels que des expositions d'art, des représentations théâtrales, des concerts, des conférences et des ateliers.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "54eeec01-c7fb-48ad-a39b-d6b8119158b2", "translation" => "دار الثقافة 'محمد بوضياف' يقدم برنامجًا غنيًا ومتنوعًا من الفعاليات الفنية، مثل معارض الفن، وعروض المسرح، والحفلات الموسيقية، والمحاضرات، وورش العمل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //33
            ["id" => "374b6f0c-0985-41a8-aa58-2c0782fd4f62", "translation" => "Located in a green and serene setting, this garden provides a space for relaxation and rejuvenation for both residents and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5d2d7b16-086c-427e-8943-74429c68e187", "translation" => "Situé dans un cadre verdoyant et serein, ce jardin offre un espace de détente et de ressourcement pour les habitants et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5ee77853-645f-45ca-9308-c43c895e861c", "translation" => "موجودة في إطار خضري هادئ، تقدم هذه الحديقة مساحة للاسترخاء والتجديد للسكان والزوار على حد سواء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //34
            ["id" => "a8125021-cfb4-4025-a056-ef38d04ff6d2", "translation" => "One of the largest beaches in Annaba. Soft, wide sand. Ideal for a family outing.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "00656038-8673-489b-98af-45c7153dec3c", "translation" => "L'une des plus grandes plages d'Annaba. Sable doux largeure conséquente. idéale pour une sortie en famille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4dcdcec7-d8eb-4af5-aacc-609658c998df", "translation" => "واحد من أكبر الشواطئ في عنابة. رمال ناعمة وعريضة. مثالية للرحلات العائلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //35
            ["id" => "7e2bc6a2-6786-4159-9e04-4ec126dae82e", "translation" => "This place offers a unique panoramic perspective of the streets, buildings, and surrounding urban landscapes. It's a privileged spot for admiring urban views, sunrises or sunsets, and iconic points of interest in the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8626e962-0587-4729-9385-ab350e3903b9", "translation" => "Ce lieu offre une perspective unique et panoramique sur les rues, les bâtiments et les paysages urbains environnants. Il constitue un lieu privilégié pour admirer les vues urbaines, les levers ou couchers de soleil et les points d'intérêt emblématiques de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4d1d8ea9-b148-4ff1-be7a-fca5a0698d76", "translation" => "هذا المكان يقدم منظورًا فريدًا وبانوراميًا على الشوارع والمباني والمناظر الحضرية المحيطة. إنها نقطة متميزة لمشاهدة المناظر الحضرية وشروق الشمس أو غروبها، ونقاط الاهتمام البارزة في المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //36
            ["id" => "5214ca5c-869f-4563-b71b-75cbbee75cea", "translation" => "The Edough national park is a preserved natural treasure, offering an exceptional diversity of landscapes and biodiversity. Its vast expanses include mountains, forests, plains, rivers, and rich wildlife and flora. Visitors can explore hiking trails, discover waterfalls, observe rare bird species, and admire breathtaking panoramas.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4177d38b-9320-498a-b333-1f7900c59af0", "translation" => "Le parc national Edough est un trésor naturel préservé, offrant une diversité exceptionnelle de paysages et de biodiversité. Ses vastes étendues comprennent des montagnes, des forêts, des plaines, des cours d'eau et une riche faune et flore. Les visiteurs peuvent explorer les sentiers de randonnée, découvrir des cascades, observer des espèces d'oiseaux rares et admirer des panoramas à couper le souffle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bed636b9-0c27-4e7b-818f-e873fb6251d0", "translation" => "الحظيرة الوطنية إيدوغ كنز طبيعي محفوظ، يقدم تنوعًا استثنائيًا من المناظر الطبيعية والتنوع البيئي. تشمل مساحاته الشاسعة جبالًا وغاباتٍ وسهولًا وأنهارًا وتنوعًا غنيًا من الحياة البرية والنباتات. يمكن للزوار استكشاف مسارات المشي، واكتشاف الشلالات، ومراقبة أنواع الطيور النادرة، والتمتع بمناظر خلابة تأسر الأنفاس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //37
            ["id" => "00b3e277-489f-4361-b4bc-9eec35fd445e", "translation" => "One of the most well-known and frequented beaches in the entire region, Djenen el Bey is a place for relaxation and leisure where one can enjoy the sun, water, and the natural beauty of the coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a7e7b588-f2ce-4304-b58d-1962733c89a6", "translation" => "L’une des plages les plus connues et fréquentées de toute la région, Djenen El Bey est un lieu de détente et de loisirs où l'on peut profiter du soleil, de l'eau et de la beauté naturelle de la côte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "01e2b5fb-3681-4179-9dad-a110e9afeb76", "translation" => "إحدى أشهر وأكثر الشواطئ زيارة في المنطقة، جنان الباي هو مكان للراحة والترفيه حيث يمكن للزائرين الاستمتاع بأشعة الشمس والماء وجمال الطبيعة الساحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //38
            ["id" => "71bb8563-d601-4493-b312-516b864f3c78", "translation" => "The Annaba lighthouse 'Cap de garde' is an iconic structure in the region. Its imposing height provides stunning panoramic views of the sea and the surroundings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "456514b9-7e20-41ec-a8e9-0a964251a678", "translation" => "Le Phare de Cap de Garde est une structure emblématique de la région. Sa hauteur imposante offre une vue panoramique imprenable sur la mer et les environs", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "99b3e2d9-9f14-4f12-85a6-c91aee7ddf0f", "translation" => "منارة عنابة هي هيكل رمزي في المنطقة. ارتفاعها المهيب يوفر مناظر بانورامية رائعة للبحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //39
            ["id" => "7946407c-28c0-474f-8e50-35fc2d8f3525", "translation" => "Ain Achir beach is a suitable place for swimming, sunbathing, fishing, and walks.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c952053a-1f7f-4123-a976-525fe2f2118e", "translation" => "La plage d'Ain Achir est un endroit propice à la baignade,aux bains de soleil, à la pêche et aux promenades.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1117f480-f296-4d12-88e7-1e02b852fe55", "translation" => "شاطئ عين عشير هو مكان مناسب للسباحة والاستلقاء تحت أشعة الشمس أو للصيد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //40
            ["id" => "f4d69e9d-02a4-4860-924c-2fbb2bbd6a4f", "translation" => "This beach provides a serene atmosphere perfect for relaxation and rejuvenation. The crystal-clear waters of the beach are ideal for swimming. Overall, this beach is undoubtedly one of the best places for anyone seeking an unforgettable experience on the beaches of Annaba.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "384077dc-64b1-4525-8a1c-b0104156667e", "translation" => "Cette plage offre une atmosphère sereine parfaite pour la détente et la revitalisation. Les eaux cristallines de la plage sont idéales pour la baignade.Dans l'ensemble, cette plage est sans aucun doute l'un des meilleurs endroits pour quiconque cherche une expérience inoubliable sur les plages d’Annaba.d’Annaba.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "97d9da53-4a13-4aff-b580-2cccad441866", "translation" => "يوفر هذا الشاطئ أجواءً هادئة مثالية للراحة واستعادة النشاط. مياه البحر الصافية تعتبر مثالية للسباحة. بشكل عام، هذا الشاطئ هو بلا شك واحد من أفضل الأماكن لأي شخص يبحث عن تجربة لا تُنسى على شواطئ عنّابة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //41
            ["id" => "c92c718b-6cfe-43fe-808a-31745248d3ba", "translation" => "This beach is a great place to relax, rejuvenate, swim, sunbathe, and admire the beautiful sunsets over the endless sea horizon.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ddef07de-1b6b-47c9-9848-25b496e808dc", "translation" => "Cette plage est un excellent endroit pour se détendre, se ressourcer, nager, prendre un bain de soleil et admirer les magnifiques couchers de soleil sur l'horizon infini de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c673a6ff-e503-4721-869f-174f719867db", "translation" => "هذه الشاطئ مكان ممتاز للاسترخاء واستعادة النشاط، السباحة، التشمس، والتمتع بمناظر الغروب الرائعة فوق أفق البحر اللانهائي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //42
            ["id" => "62fbfe12-9cce-448e-afdd-ba629f0fe61d", "translation" => "Listed as a national heritage site, its construction dates back to the Hafsid state in the 13th century, with several modifications made during the colonial period. A symbol of the cultural and historical wealth of the region, it continues to pique the curiosity of history enthusiasts among visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "36438f1c-0c27-470e-82e2-87c19fdfb88c", "translation" => "Classée au patrimoine national, sa construction remonte à l’époque de l’État hafside au XIIIe siècle, plusieurs modifications y furent apportées pendant la période coloniale. Symbole de la richesse culturelle et historique de la région, il attise toujours autant la curiosité des visiteurs amateurs d’histoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "12ca19d7-b72a-436c-9c24-fbd2bd74e35f", "translation" => "مُصَنَّف كموقع تراث وطني، تعود بنيانه إلى عهد الدولة الحفصية في القرن الثالث عشر، حيث أُجريت تعديلات عديدة عليه خلال الفترة الاستعمارية. يُعتبر رمزًا للثروة الثقافية والتاريخية للمنطقة، ولا يزال يثير فضول عشاق التاريخ من بين الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //43
            ["id" => "0567dc27-7677-43aa-895e-44abf6dd1f71", "translation" => "The Salah Bey mosque is an architectural gem that reflects the beauty of Islamic art. It was built in the 18th century by the bey of Constantine.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1e6c9ae5-6084-4d71-8a50-797a77ab593c", "translation" => "La mosquée Salah Bey est un joyau architectural qui reflète la beauté de l'art islamique. Construite au 18ème siècle par le bey de Constantine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "278d38cb-6dc9-4426-9092-9ba0aff444c5", "translation" => "جامع صالح باي هو جوهرة معمارية تعكس جمال الفن الإسلامي. تم بناؤه في القرن الثامن عشر من قبل باي قسنطينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //44
            ["id" => "9e8f4c43-ece1-4fc9-9398-e15c16a12f2a", "translation" => "With its benches and trees, the small square provides an ideal setting for resting, chatting, or simply observing the surrounding activity. The cafes and terraces lining the square add a lively atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "930f2b8f-e10b-496a-b149-d503a355abcb", "translation" => "Avec ses bancs et ses arbres, la placette offre un cadre idéal pour se reposer, discuter ou simplement observer l'activité environnante. Les cafés et les terrasses bordant la placette ajoutent une atmosphère animée", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "389c56b8-b207-4eb8-a7b7-1ccdc3178255", "translation" => "بمقاعدها وأشجارها، توفر الساحة الصغيرة إطارًا مثاليًا للراحة والدردشة أو مجرد مراقبة النشاط المحيط. يضيف المقاهي والتراسات المحيطة بالساحة أجواءً حيةً.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //45
            ["id" => "a9da9924-bfe5-4e28-93a5-9a4b5c52f8b2", "translation" => "Whether you're looking for a peaceful place to relax, a meeting spot with friends, or a natural space to enjoy the outdoors, the el Hourria garden is a true haven of peace that offers you a rejuvenating break in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b01dea81-61fd-4b30-9b78-1f34e7ed5f38", "translation" => "Que vous soyez à la recherche d'un endroit tranquille pour vous détendre, d'un lieu de rendez-vous entre amis ou d'un espace naturel pour profiter des joies du plein air, le jardin el Hourria est un véritable havre de paix qui vous offre une pause ressourçante au cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "63ae5a0f-54c8-4386-8687-e75da1380e95", "translation" => "سواء كنت تبحث عن مكان هادئ للاسترخاء أو مكان للقاء الأصدقاء أو مساحة طبيعية للاستمتاع بأجواء الهواء الطلق، فإن حديقة الحرية هي ملاذ حقيقي للسلام تقدم لك استراحة في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //46
            ["id" => "e9d86aab-cb89-46c7-b39b-7e684ae45ad0", "translation" => "The Annaba theater is an artistic and cultural institution built towards the end of the 19th century. Today, it plays a role in the local and national cultural, political, social, and spiritual life through theatrical productions, galas, and various artistic exhibitions.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fcf4660e-f200-4398-a397-a1a1a36d681b", "translation" => "Le Théâtre de Annaba est une institution artistique et culturelle construite vers la fin du 19ème siècle. Il participe aujourd’hui dans la vie culturelle,politique, sociale et spirituelle au niveau local et national par le biais de productions théâtrales, de galas et d’expositions artistiques diverses et variées,", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c91486a2-258e-40e1-86ad-e059d93c1bc0", "translation" => "مسرح عنابة مؤسسة فنية وثقافية بُنيت نحو نهاية القرن التاسع عشر. اليوم، يلعب دورًا في الحياة الثقافية والسياسية والاجتماعية والروحية على الصعيدين المحلي والوطني من خلال الإنتاجات المسرحية والحفلات والمعارض الفنية المتنوعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //47
            ["id" => "080246da-d4e3-435a-95f3-458a2efecc43", "translation" => "A historical monument of a military nature, it is believed to have been built during the Hafsid era to protect the city from external attacks. It was restored and refurbished by colonial authorities in 1861.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "91a5fb02-ebe5-4deb-8353-0a82893fb111", "translation" => "Un monument historique de caractère militaire, il aurait été construit durant l'époque hafside afin de protéger la ville des attaques extérieures. Il a été restauré et aménagé par les autorités coloniales en 1861.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "053223ac-bd8f-47ac-a751-e1462ed39671", "translation" => "نصب تاريخي من الطابع العسكري، يُعتقد أنه تم بناؤه خلال فترة الحفصيين لحماية المدينة من الهجمات الخارجية. تمت استعادته وتجديده من قبل السلطات الاستعمارية في عام 1861.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //48
            ["id" => "f7b2dbb0-7afa-4646-b333-8e177ffbd52b", "translation" => "The Aqueduct of Hippone is a historically significant site, showcasing the grandeur of Roman architecture and the ingenuity of the time. Visitors can admire the remains of this majestic aqueduct and envision the vital role it played in the daily life of the city of Hippone during Roman times.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c63ba679-6583-4b63-9e8a-cac11e42ac64", "translation" => "L’aqueduc de Seraïdi fait partie de plusieurs aqueducs qui acheminaient l’eau à l’époque romaine, des montagne de l’Edough à la ville berbéro-romaine Hippone", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d1530e34-aa51-491d-b65a-1c3a2363914d", "translation" => "قناة هيبون الرومانية هو موقع تاريخي ذو أهمية كبيرة، يعكس عظمة الهندسة الرومانية وذكاء العصور القديمة. يمكن للزوار أن يعجبوا ببقايا هذه المائية الفخمة ويتخيلون الدور الحيوي الذي كانت تلعبه في الحياة اليومية لمدينة هيبون في عصر الرومان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //49
            ["id" => "e8b8763e-bde8-4dae-bfa1-963d9e10d114", "translation" => "Lake Fetzara is a biodiversity treasure and also a paradise for bird enthusiasts, hosting numerous species of migratory and native birds. Visitors can enjoy picnics by the water and moments of tranquility in a preserved natural setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a7c059ac-c9f8-4dd2-87e6-6ca9ba0d47a5", "translation" => "Le lac Fetzara est un trésor de biodiversité mais également un paradis pour les amateurs d'ornithologie, abritant de nombreuses espèces d'oiseaux migrateurs et indigènes. Les visiteurs peuvent profiter de pique-niques au bord de l'eau et de moments de quiétude dans un cadre naturel préservé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3f87cb5d-57aa-45aa-a66d-23e9dcaf6a7e", "translation" => "بحيرة فتزارة هي كنز للتنوع البيئي وأيضًا ملاذًا لهواة علم الطيور، حيث تستضيف العديد من أنواع الطيور المهاجرة والمحلية. يمكن للزوار الاستمتاع بنزهات على ضفاف البحيرة ولحظات هدوء في إطار طبيعي محمي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //50
            ["id" => "9168356f-24c6-4707-900c-5b82d35cd4e0", "translation" => "The Fortin, a relic from the colonial era, still stands steadfastly over the region despite the ravages of time and a noticeable lack of maintenance. Nevertheless, it remains an important historical monument in the region that deserves attention.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9af2d513-0c0b-4ed5-a4b0-6da0693e63a5", "translation" => "Le Fortin, vestige de l'époque coloniale, il surplombe toujours inlassablement la région malgré les affres du temps et un manque de maintenance flagrant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2b3fd94d-84b1-492d-93d6-d2b5ec45a4ff", "translation" => "الحصن، آثار من العصر الاستعماري، لا يزال يقف بحزم فوق المنطقة على الرغم من تأثيرات الزمن ونقص واضح في الصيانة. ومع ذلك، فإنه لا يزال يعتبر من الأمور التاريخية الهامة في المنطقة التي تستحق الاهتمام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //51
            ["id" => "070bfa70-b554-41e0-955e-909a7c45e03d", "translation" => "A predominantly rocky beach, it also provides a panoramic view of the horizon where the sea stretches as far as the eye can see. It's an ideal place to appreciate the contrasts between natural elements and connect with the raw beauty of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d5c7302f-f151-4fb0-b4a4-9604998f3410", "translation" => "Plage principalement rocheuse, elle offre également une vue panoramique sur l'horizon, où la mer s'étend à perte de vue. C'est un lieu idéal pour admirer les contrastes entre les éléments naturels et se connecter à la beauté brute de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "de45644f-03fb-4425-be71-1faa60d334e4", "translation" => "شاطئ يتميز بصخوره بشكل رئيسي، ويوفر أيضًا إطلالة بانورامية على الأفق حيث تمتد البحر بقدر ما تبوح به العيون. إنه مكان مثالي لتقدير التناقضات بين العناصر الطبيعية والاتصال بجمال الطبيعة الخام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //52
            ["id" => "222e49ae-367f-414f-b446-113270ad44ef", "translation" => "Berrahal forest is a natural treasure. Majestic trees reach towards the sky, forming a dense canopy of greenery. The ground is covered with a carpet of leaves and lush vegetation. The forest is also home to a multitude of animal species, making it an important ecosystem that should be cherished and, above all, protected.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "51fcf1de-6c88-41f7-8b90-cbefe5b845ab", "translation" => "La forêt de Berrahal est un trésor naturel. Les arbres majestueux s'élèvent vers le ciel, formant un dôme de verdure dense. Le sol est recouvert d'un tapis de feuilles et de végétation luxuriante. La forêt abrite aussi une multitude d'espèces animales ce qui en fait un important écosystème qu’il faut chérir et surtout protéger.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "268f666e-1f0d-4b5b-bfdd-092f32ca33a5", "translation" => "غابة برحال هي كنز طبيعي. الأشجار الرفيعة تمتد نحو السماء، مكوّنة قبة كثيفة من الخضرة. الأرض مغطاة بسجادة من الأوراق والنباتات الخصبة. تحتضن الغابة أيضًا متعددًا من أنواع الحيوانات، مما يجعلها نظامًا بيئيًا مهمًا يجب الاهتمام به وحمايته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //53
            ["id" => "866ec256-955c-4d19-b92a-d137ccb58316", "translation" => "Its turquoise water and panoramic view make it a truly enchanting place right in the heart of the berrahal forest.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f80da111-4789-4ed5-a499-3d08f668faa3", "translation" => "Son eau turquoise et son panorama en font un lieu réellement féerique au beau milieu de la forêt de Berrahal.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ddf6dc42-bd15-4838-8853-c749142a1a6c", "translation" => "مياهها اللون الفيروزي ومنظرها البانورامي يجعلونها مكانًا ساحرًا حقًا في قلب غابة برحال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //54
            ["id" => "004d0c90-c8b2-4690-aa73-95f571498b62", "translation" => "Located to the north of the city of Annaba, Saint Cloud beach is one of the most popular beaches throughout the year due to its geographical location and the availability of transportation. It also has a wide promenade of several hundred meters. Just across from it, you can find various shops, restaurants, fast-food outlets, etc…", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1c8a29b3-12bb-4bd6-a8b6-833e5ed771c8", "translation" => "Située au nord de la ville d’Annaba, la plage Saint Cloud est parmi les plages les plus populaires durant toute la période de l’année et ce, de par sa position géographique et la disponibilité des moyens de transport. Elle dispose également d’une large corniche de plusieurs centaines de mètres. Juste en face, plusieurs commerces dont des magasins, restaurants, fastfoods, etc.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "873ef99e-ad58-4365-8422-214edd3b836f", "translation" => "يقع شاطئ سان كلو شمال مدينة عنابة، وهو واحد من أكثر الشواطئ شعبية على مدار السنة بفضل موقعه الجغرافي وتوفر وسائل النقل. كما أنه يحتوي على كورنيش واسع يمتد لعدة مئات من الأمتار. ومباشرة من مقابله، يمكنك العثور على متاجر متنوعة ومطاعم سريعة الوجبات، وما إلى ذلك…", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //55
            ["id" => "844534d5-d2fd-4bd5-ae97-59319f5495e5", "translation" => "The island towers over a string of rocks around it, while its lighthouse dating back to 1847 stands proudly on the island, offering a spectacular panorama of the surroundings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e5c5afe2-7e93-465d-886a-6505e183b995", "translation" => "L’île domine un véritable chapelet de rochers autour d’elle alors que son phare qui date de 1847 se dresse fièrement sur l'île, offrant un panorama spectaculaire sur les environs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "15edf567-3a67-498b-8560-cf065cd6fe35", "translation" => "الجزيرة تتفوق على سلسلة من الصخور حولها، في حين يقف منارتها التي تعود إلى عام 1847 بفخر على الجزيرة، مقدمة مناظر خلابة للمناطق المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //56
            ["id" => "4cec6906-4890-43c2-bf09-7e6b3f545b2f", "translation" => "The Roman theater of Russicada, which shares many similarities with those of Timgad, Djemila, M’daourouche, and Tipasa, overlooks the sea and is one of the largest and most spacious theaters built by the Romans in North Africa, with architecture inspired by Greek theater.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b5441a2c-ef07-467d-a142-609c533c45d3", "translation" => "Le théâtre romain de Russicada qui possède de nombreuses similitudes avec ceux de Timgad, Djemila,M’daourouche", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5d33d943-f6a7-4f14-a445-cdb60650e5b6", "translation" => "المسرح الروماني في روسيكادا، الذي يشترك في العديد من التشابهات مع تلك الموجودة في تيمقاد وجميلة مداوروش وتيبازة، يطل على البحر وهو واحد من أكبر وأوسع المسارح التي بناها الرومان في شمال إفريقيا، بتصميم مستوحى من المسرح اليوناني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //57
            ["id" => "bc938a5f-dd93-4569-94f4-59ce3b3976ac", "translation" => "The regional theater is considered a rare architectural masterpiece with its ancient Italian style and the baroque decorative style that fills the various corners of the building, adding vitality and majesty to its architectural value, which attracts everyone who visits the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e7258a63-db0f-499e-92e0-9a4fd7267f9c", "translation" => "Le théâtre régional est considéré comme un chef-d'œuvre architectural rare avec son style italien ancien et le style de décoration baroque qui remplit les différents coins et recoins du bâtiment, ajoutant vitalité et majesté à sa valeur architecturale, qui attire à chaque fois tous ceux qui visitent la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a1063215-82b0-4589-b461-64e811995ede", "translation" => "المسرح البلدي يُعتبر تحفة معمارية نادرة بأسلوبه الإيطالي القديم والزخارف الباروكية التي تملأ أركان المبنى المختلفة، مما يضيف حيوية وسموًا لقيمته المعمارية، والتي تجذب كل من يزور المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //58
            ["id" => "b9640999-19b9-460f-93f1-73bac0493c5d", "translation" => "The Skikda museum is a fascinating cultural venue that houses a rich collection of artifacts and historical objects. It takes visitors on a journey through the history and culture of the region. The exhibitions highlight, among other things, local craftsmanship, archaeology, and ancestral traditions.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "72aab2d6-9f2c-45bf-a1a7-b395b6fcaac3", "translation" => "Le musée de Skikda est un lieu culturel fascinant qui abrite une riche collection d'artefacts et d'objets historiques. Il offre aux visiteurs un voyage à travers l'histoire et la culture de la région. Les expositions mettent en valeur entre autres l'artisanat local, l'archéologie et les traditions ancestrales.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "03ca558e-d852-46d2-996b-a28d54130b54", "translation" => "متحف سكيكدة هو مكان ثقافي رائع يحتضن مجموعة غنية من القطع الأثرية والأشياء التاريخية. يقدم للزوار رحلة عبر تاريخ وثقافة المنطقة. يسلط المعارض الضوء على الحرف اليدوية المحلية وعلم الآثار والتقاليد الأسرية، وغير ذلك الكثير.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //59
            ["id" => "64f706b1-0f10-4199-a8eb-dd0b43ed64c4", "translation" => "This public garden is a peaceful green space in the heart of the city. It offers visitors an escape from the urban hustle and bustle with its colorful flower beds and shaded trees.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "26e758d2-c6e2-4c8e-aac3-34bc7a18b863", "translation" => "Ce jardin public est un espace verdoyant paisible au cœur de la ville. Il offre aux visiteurs une évasion de l'agitation urbaine grâce à ses parterres de fleurs colorées et ses arbres ombragés.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "58ad5b1a-4e28-4512-9462-93b9eabbade7", "translation" => "هذه الحديقة العامة هي مساحة خضراء هادئة في قلب المدينة. إنها تقدم للزوار فرصة للاستمتاع بالهروب من صخب الحياة الحضرية من خلال ازهارها الملونة وأشجارها المظللة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //60
            ["id" => "8590a0c7-f26c-4d56-94a1-3cf9b37e8ac7", "translation" => "The town hall is a building dating back to the colonial era, constructed in the modern Moorish style, and it never fails to attract visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5d9bd1d7-6281-4474-a246-cbf814377655", "translation" => "L’hôtel de ville est un bâtiment datant de l'époque coloniale, construit dans le style mauresque moderne et qui ne manque pas d’attirer les visiteurs,", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "60ad46d1-0402-4044-a86d-b2555486b9b5", "translation" => "مبنى البلدية هو مبنى يعود إلى العصر الاستعماري، تم بناؤه على الطراز المغاربي الحديث ولا يفوته جذب الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //61
            ["id" => "e15ed69f-31de-4725-8a35-8eeab7d96584", "translation" => "The palace was built on a wooded site overlooking the local Skikda waterfront. Designed by architect Charles Montaland, it was constructed in a neo-Moorish architectural style. A true gem of the region that deserves many more visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f0a4bc37-f227-4f36-9990-16bfc4a24c62", "translation" => "Le palais a été construit sur un site boisé qui surplombe le versant marin de la corniche locale de Skikda. Conçu par l’architecte Charles Montaland, il a été réalisé dans un style architectural néo-mauresque. Un véritable joyaux de la région qui mériterait d’avoir bien plus de visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "72b6cd67-a539-464b-99a9-dca18cf25cb7", "translation" => "تم بناء القصر على موقع محاط بالأشجار يطل على الساحل المحلي في سكيكدة. تم تصميمه بواسطة المهندس المعماري شارل مونتالاند وتم تنفيذه في أسلوب معماري مغاربي. إنه جوهر حقيقي في المنطقة يستحق المزيد من الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //62
            ["id" => "91141d09-4203-4ee3-a8dd-b3e6f16872f8", "translation" => "The regional museum of the Mujahid is a public institution responsible for the cultural and historical aspects. Its missions include the collection, preservation, and restoration of museum objects related to the popular resistance, the national movement, and the war of national liberation, and presenting them to the public.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b1c544a6-55ce-4a95-8519-705e54792a3d", "translation" => "Musée régional du Moudjahid est une institution publique chargé de l’aspect culturel et historique. Il a pour missions, la collection, la préservation et la restauration des objets de musée liés à la résistance populaire, au mouvement national et à la guerre de libération nationale et de les présenter au public.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8744d23f-8556-44ac-be9b-67dc123d248a", "translation" => "المتحف الجهوي للمجاهد مؤسسة عامة مسؤولة عن الجوانب الثقافية والتاريخية. من مهامها جمع القطع، والحفاظ عليها، واستعادتها في المتحف، والتي تتعلق بالمقاومة الشعبية والحركة الوطنية وحرب التحرير الوطنية، وتقديمها للجمهور.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //63
            ["id" => "6faf9fb7-4824-4105-b740-7e46c963fb5f", "translation" => "Built in 1862 using stones from the Roman ruins of martyrs' square to the west of the city, it is located a few meters from the port.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "59d5ee16-1c14-4ab8-aeb4-a564441afa55", "translation" => "Construite en 1862 avec des pierres provenant des ruines romaines de la Place des Martyrs à l'ouest de la ville. Elle se situe à quelques mètres du port.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6207e559-acfe-4878-bbff-a960237266cb", "translation" => "بُنيت في عام 1862 باستخدام أحجار من آثار الرومان في ساحة الشهداء في غرب المدينة، وتقع عدة أمتار فقط من الميناء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //64
            ["id" => "7161730c-5901-445d-83d2-f7fa62fce1ab", "translation" => "Located on the Djerda peninsula, the Collo lighthouse, built in 1862, is a must-visit monument for all visitors to the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "20baaca8-fc8b-439d-9d7e-0c549101090b", "translation" => "Situé sur la presqu' île de Djerda, le phare de Collo, construit en 1862 est un monument incontournable pour tous les visiteurs de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cc4644a9-16e1-4013-8e32-3607f583d214", "translation" => "موجود على شبه جزيرة الجردة، منارة القل التي تم بناؤها في عام 1862، هي نصب لا غنى عنه لجميع الزوار إلى المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //65
            ["id" => "3c7741d8-dc8e-403f-9577-99d1bb768aac", "translation" => "Sanhaja forest is a prime forest tourism destination for those looking to switch from a seaside vacation during the summer season to the forest, or simply for hiking, sports, and a breath of fresh air.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a1b199ee-9abd-4c6e-89f7-6854bc5e899f", "translation" => "La forêt Sanhaja est une destination touristique forestière de premier choix pour ceux qui veulent changer de destination touristique durant la saison estivale de la mer à la forêt ou simplement faire de la randonné, du sport et prendre un bol d’air frais.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "97029cb4-d6cd-425f-b322-79dec3ae4609", "translation" => "غابة صنهاجة هي وجهة سياحية غابية رئيسية لأولئك الذين يبحثون عن تغيير وجهة العطلة البحرية خلال موسم الصيف إلى الغابة، أو ببساطة للمشي لمسافات طويلة وممارسة الرياضة و التنفس بالهواء النقي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //66
            ["id" => "0090b6d3-3364-4dee-9e48-8c7ace2a2e7e", "translation" => "The calm waters of the Hadj Tahar lake reflect the beauty of the surrounding landscape, creating a serene and harmonious atmosphere. The shores of the lake are lined with lush vegetation, offering soothing shades of green.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a3438229-7694-4473-ae53-062a3aa66a8c", "translation" => "Les eaux calmes du lac Hadj Tahar reflètent la beauté du paysage environnant, créant ainsi une atmosphère sereine et harmonieuse. Les rives du lac sont bordées d'une végétation luxuriante, offrant des nuances de vert apaisants.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5b5d1299-d15a-481c-aa39-220db4d0367e", "translation" => "مياه بحيرة الحاج الطاهر الهادئة تعكس جمال المناظر المحيطة بها، مما يخلق جوًا هادئًا ومتناغمًا. وتتخلل ضفاف البحيرة نباتات غنية وتقدم درجات مهدئة من اللون الأخضر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //67
            ["id" => "eb050d1c-1589-4945-833c-5a65e09d2f45", "translation" => "El marsa beach is a lively and dynamic place, offering a panoramic view of port activities. The fine, golden sand stretches along the shore, inviting visitors to relax and enjoy the sun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dd6940f1-1194-4ff5-aa73-6b08367a8d61", "translation" => "La plage d’el marsa est un endroit animé et dynamique, offrant une vue panoramique sur les activités portuaires. Le sable fin et doré s'étend le long du rivage, invitant les visiteurs à se détendre et à profiter du soleil.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9ef2261f-c99f-4e70-8a42-350ebfe79914", "translation" => "شاطئ المرسى هو مكان حيوي حيث يقدم إطلالة بانورامية على الأنشطة المينائية. الرمال الناعمة والذهبية تمتد على طول الساحل، مما يدعو الزوار للاسترخاء والاستمتاع بأشعة الشمس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //68
            ["id" => "944762a7-80e9-4e6f-b64d-e680b1917d3c", "translation" => "The Cap de Fer lighthouse is a navigational beacon lighthouse built in 1907 and located at the northernmost point of the Algerian coast to the east of the city of Skikda.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "44c6fc71-27f9-461e-9717-2b1401b7f72b", "translation" => "Le phare de Cap de Fer est un phare de jalonnement construit en 1907 et situé au point le plus septentrional de la côte algérienne à l'est de la ville de Skikda.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "239f64be-5892-475e-babc-38d194ccf8b0", "translation" => "منارة  رأس الحديد هي منارة توجيهية تم بناؤها في عام 1907 وتقع في أقصى شمال الساحل الجزائري شرق مدينة سكيكدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //69
            ["id" => "d18055fd-9a97-4e3f-9ce7-d1a31071dd81", "translation" => "Tamanart beach is a true natural gem, combining cleanliness and scenic beauty to perfection. It's the perfect spot for lovers of wild beaches, offering a peaceful and unspoiled setting that invites relaxation and exploration.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "910a1fb5-fd3a-4874-82b5-84b58957cf9d", "translation" => "La plage Tamanart est un véritable joyau naturel, alliant propreté et beauté scénique à la perfection. C'est l'endroit idéal pour les amateurs de plages sauvages, offrant un cadre paisible et préservé qui invite à la détente et à la découverte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "59b24517-7570-4bee-b9a9-528cb13718ec", "translation" => "شاطئ تمانارت جوهرة طبيعية حقيقية، حيث تجتمع النظافة وجمال المناظر الطبيعية بكمالهما. إنه المكان المثالي لعشاق الشواطئ البرية، حيث يوفر بيئة هادئة ومحافظة تدعو إلى الاسترخاء واستكشاف الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //70
            ["id" => "9be33a0e-7d45-46ba-a19e-6cba0ffe514a", "translation" => "The Stora port is known to be particularly lively in the evening. The restaurants and cafes along the promenade offer a variety of culinary delights, attracting visitors in search of nighttime pleasures.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b51a582c-5649-4cdc-8a36-46b45b2057d7", "translation" => "Le port de Stora est réputé être particulièrement animé le soir. Les restaurants et les cafés le long de la promenade offrent une variété de délices culinaires, attirant les visiteurs en quête de plaisirs nocturnes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c0dbf894-24f4-4a3c-81cf-c7fc582bd312", "translation" => "ميناء سطورة معروف بأنه حيوي بشكل خاص في المساء. المطاعم والمقاهي على طول الكورنيش تقدم مجموعة متنوعة من الأطعمة اللذيذة، ما يجذب الزوار الباحثين عن لحظات ممتعة في الليل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //71
            ["id" => "426bb766-0046-42c1-b23f-57b80dfd3155", "translation" => "The Afanso waterfalls are an enchanting natural spectacle. Nestled in the heart of lush vegetation, these waterfalls provide a soothing symphony of sounds and a captivating sight.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9128eb6b-4667-4a75-9c2d-bde80ebf7783", "translation" => "Les chutes d’Afanso sont un spectacle naturel enchanteur. Nichées au cœur d'une végétation luxuriante, ces cascades offrent une symphonie apaisante de sons et une vision captivante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8de26602-e525-4e46-9f1e-ff3a58466a87", "translation" => "شلالات افنسو هي مشهد طبيعي ساحر. مدفونة في قلب نباتات غنية، تقدم هذه الشلالات سيمفونية مهدئة من الأصوات ومشهدًا جذابًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //72
            ["id" => "3d52f5f1-0975-4b3e-8155-a8491e492919", "translation" => "The Ghadir Umm al-Dukhan waterfall, located below the Ghadir Umm al-Qishr waterfall, is a natural treasure that provides an extraordinary panorama for visitors who climb the winding and steep paths to access it.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2e21573e-5909-4f15-92de-9780b9739034", "translation" => "La cascade de Ghadir Umm al-Dukhan qui se situe en contrebas de la cascade de Ghadir Umm al-Qishr est un trésor naturel qui offre un panorama extraordinaire pour les visiteurs qui gravissent les chemins sinueux et abrupts pour y accéder.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "77ab5b19-324e-4529-b59d-df3538797569", "translation" => "شلال غدير أم الدخان، الذي يقع أسفل شلال غدير أم القشر، هو كنز طبيعي يقدم مناظر استثنائية للزوار الذين يتسلقون المسارات المتعرجة والوعرة للوصول إليه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //73
            ["id" => "859f74fc-2961-4735-812d-852d9bc8d8c4", "translation" => "Also known as the 'Colorful Forest', the Tizaghban forest is characterized by an impressive diversity of trees, plants, and animals. This makes it a must-visit destination for nature enthusiasts, hikers, and campers alike.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ff4ed85b-1390-4560-98de-935099112f70", "translation" => "Appelée aussi la forêt colorée, la forêt de Tizaghban est caractérisée par une diversité impressionnante d'arbres, de plantes et d'animaux. Ce qui en fait un lieu incontournable pour tous les amateurs de nature, de randonnée ou de camping.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5dc4f4ec-6343-470e-91c3-d0788b8869f9", "translation" => "المعروفة أيضًا بغابة الألوان، تتميز غابة تيزغبان بتنوع مذهل من الأشجار والنباتات والحيوانات. وهذا ما يجعلها وجهة لا غنى عنها لجميع عشاق الطبيعة، والمتنزهين، ومحبي التخييم على حد سواء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //74
            ["id" => "95e59872-913d-4eea-a834-fd36c78164d3", "translation" => "Its crumbling walls and collapsed staircases tell an unknown story, cherished by time. The remnants of its structure hark back to its past significance in maritime navigation, all the while inviting visitors to imagine and speculate about its lost history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "339da06d-ecb8-43a6-8dd9-39ba3550d6f8", "translation" => "Ses murs décrépits et ses escaliers effondrés racontent une histoire inconnue, gardée précieusement par le temps. Les vestiges de sa structure rappellent son importance passée dans la navigation maritime tout en invitant les visiteurs à imaginer et à spéculer sur son histoire perdue.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "13d52689-06a8-4f2c-877c-17c144a385da", "translation" => "جدرانه المتحللة وسلالمه المنهارة تحكي قصة غير معروفة، تُحتفظ بها بعناية من قِبَل الزمن. آثار هيكله تُذكِّر بأهميتها في الماضي في الملاحة البحرية، مما يدعو الزوار إلى تخيّل والتأمّل في تاريخها الضائع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //75
            ["id" => "527a5fbd-7793-4075-b342-10f83e500121", "translation" => "Ain Dawla beach is a place for relaxation and entertainment where you can enjoy the natural beauty and tranquility of the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "311c1b7d-79cc-45d1-83db-5d335bb91881", "translation" => "La plage Ain Dawla est un lieu de détente et de divertissement où l'on peut profiter de la beauté naturelle et du calme de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f48ac035-f886-468e-ba1c-b77c4ccf8df9", "translation" => "شاطئ عين الدولة هو مكان للاسترخاء والترفيه حيث يمكنك الاستمتاع بجمال الطبيعة وهدوء البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //76
            ["id" => "46fb2f2d-3ad1-4cd9-a1e1-2b5cffaf7b0e", "translation" => "One of the most legendary and beloved beaches for the people of Collo, just outside the town, a short distance from the port.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "48e77d94-cb66-4405-9294-25ce387affa0", "translation" => "Une des plages les plus mythiques et appréciées des colliotes, juste à la sortie de la ville, à quelques brasses du port.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "930436e9-b469-4a9c-a3bf-da8e3739f8f4", "translation" => "إحدى أكثر الشواطئ أسطورية ومحببة لسكان القل، يقع خارج المدينة، على مسافة قصيرة من الميناء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //77
            ["id" => "6491d504-4e51-4cc3-9d59-1abff347175c", "translation" => "Historical monument of the city representing the ship of the Barbarossa brothers, who provided assistance to the people of Jijel against the Spanish forces.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "64d850a8-5791-429a-9a82-27618d0ec718", "translation" => "Monument historique de la ville représentant le navire des frères Barberousse qui ont apporté leur aide aux habitants de Jijel contre les forces espagnoles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9d78074b-b18d-4e36-84a7-3089c4743f0d", "translation" => "نصب تاريخي للمدينة الذي يمثل سفينة الأخوة بربروس الذين قدموا مساعدتهم لأهل جيجل ضد القوات الإسبانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //78
            ["id" => "c5c3510d-bdd0-440c-b0e0-d01f5013d45e", "translation" => "The fisherman's statue is one of the historical symbols that bear witness to all the events, both happy and tragic, that the city has witnessed.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0efb78d7-8f72-4b1b-87fd-6d2c3eb4780e", "translation" => "La statue du pêcheur est l'un des symboles historiques qui témoignent de tous les événements aussi bien heureux que tragiques dont la ville fut le témoin.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0f98bcfe-00fa-4a9f-8b81-6e321f63450c", "translation" => "تمثال الصياد هو أحد الرموز التاريخية التي تشهد على جميع الأحداث، سواء السعيدة أو المأساوية، التي شهدتها المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //79
            ["id" => "9ffc45f6-e063-4758-a54c-93492c6712be", "translation" => "The Ras el Afia lighthouse is one of the largest and oldest among the 24 beacons along the Algerian coast. It was built by the French sculptor Charles Salva in 1867 on top of the 'Grifat' using a type of local blue-colored stone.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dbe0638e-43b0-4d61-9a2d-7179467ca0a3", "translation" => "Le phare de Ras el Afia est l'un des plus grands et des plus anciens des 24 balises du littoral algérien. Il a été construit par le sculpteur français Charles Salva en 1867 au sommet du 'Grifat' à l'aide d'une sorte de pierre locale de couleur bleue.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "101846e7-52ff-423e-976b-8d92b3ba3607", "translation" => "منارة رأس العفية هي واحدة من أكبر وأقدم المنارات بين 24 منارة على الساحل الجزائري. تم بناؤها من قبل النحات الفرنسي شارل سالفا في عام 1867 على قمة 'غريفات' باستخدام نوع من الحجر المحلي ذو اللون الأزرق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //80
            ["id" => "4cc06cfa-4ef6-437e-98bd-428680eb0be1", "translation" => "The Kotama museum is a fascinating place where history and culture come to life. Its walls house artistic treasures and precious artifacts that tell stories from the past.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e9930df1-5c4a-409b-a935-489033a49471", "translation" => "Le musée Kotama est un lieu fascinant où l'histoire et la culture prennent vie. Ses murs abritent des trésors artistiques et des artefacts précieux qui racontent des récits du passé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c2294703-62dd-4213-9d9a-8a403ae22f5e", "translation" => "متحف كتامة هو مكان رائع حيث تتجسد التاريخ والثقافة. جدرانه تحتضن كنوزًا فنية وقطعًا أثرية ثمينة تحكي قصصًا من الماضي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //81
            ["id" => "79cb07fd-cfdd-4b76-bef2-e3940339ad6d", "translation" => "The Museum of the Mujahid is a place that pays tribute to the heroes of the war of independence. It houses a collection of historical objects and documents that recount this crucial period in the country's history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6c098a86-c3c8-4077-b54f-d54e47a804d8", "translation" => "Le musée el Moudjahid est un lieu qui rend hommage aux héros de la guerre d'indépendance. Il abrite une collection d'objets historiques et de documents relatant cette période cruciale de l'histoire du pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2f92d342-b5f3-4612-9e72-e477b70523a7", "translation" => "متحف المجاهد هو مكان يكرم أبطال حرب الاستقلال. إنه يحتوي على مجموعة من الأشياء التاريخية والوثائق التي تحكي عن هذه الفترة الحاسمة في تاريخ البلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //82
            ["id" => "23ba0da4-632c-4e50-a512-b1e5f8cbfebc", "translation" => "Exhibitions and demonstrations are organized there to showcase trades and allow visitors to discover traditional products from all regions of the country.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "67b60d41-56cd-4e8d-8c16-be839f2f7920", "translation" => "Des expositions et des démonstrations y sont organisées pour mettre en valeur les métiers et permettre aux visiteurs de découvrir des produits traditionnels de toutes les régions du pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bcbf232b-1348-46ce-8951-93b6b9cfab51", "translation" => "تُنظّم هناك معارض وعروض توضيحية لإبراز المهن وتمكين الزوار من اكتشاف المنتجات التقليدية من جميع مناطق البلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //83
            ["id" => "7de10810-8cb3-4ca1-9de8-76b01c646933", "translation" => "Remnant of the city wall of Jijel", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "93c041f6-1805-4534-927d-94788987020d", "translation" => "Vestige de la muraille de la ville de Jijel", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c3d5feb5-abc1-4cb0-970a-eeadc0d23c2d", "translation" => "بقايا سور مدينة جيجل", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //84
            ["id" => "42a3df23-b26c-473e-bbdc-4e86c8730066", "translation" => "The Punic necropolis is an archaeological site of great historical significance. It houses numerous Phoenician tombs and burials.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "74437e35-0038-4a30-8862-207ac5476dd1", "translation" => "La Nécropole Punique est un site archéologique d'une très grande importance historique. Elle abrite de nombreuses tombes et sépultures phéniciennes", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d5bcae3c-7424-4f4d-a3d8-4288c7f00792", "translation" => "المقبرة الفينيقية هي موقع أثري ذو أهمية تاريخية كبيرة. إنها تضم العديد من المقابر والمدافن الفينيقية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //85
            ["id" => "607add0b-eb1e-46b3-976c-eeebfbab8189", "translation" => "The great mosque of Jijel, a magnificent architectural wonder, graces the bustling center of the city. This historic mosque, a true testament to the city's rich heritage, was designed and built in 1875 under the skillful guidance of the renowned architect Ségade. Its imposing presence serves as a symbol of religious and cultural significance in Jijel, attracting both locals and visitors to admire its intricate details and timeless beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "16b5c3a1-b945-40d4-a2c8-6df971c474d0", "translation" => "La grande mosquée de Jijel, une magnifique merveille architecturale, orne le centre animé de la ville. Cette mosquée historique, véritable témoignage du riche patrimoine de la ville, a été conçue et construite en 1875 sous la direction habile du célèbre architecte Ségade. Sa présence imposante est un symbole de signification religieuse et culturelle à Jijel, attirant à la fois les habitants et les visiteurs pour admirer ses détails complexes et sa beauté intemporelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f948a895-1212-4cd3-a0db-fc1d58d45195", "translation" => "جامع جيجل الكبير، عجز معماري رائع، يزين وسط المدينة النابض بالحياة. هذا المسجد التاريخي، الشاهد الحقيقي على التراث الغني للمدينة، تم تصميمه وبناؤه في عام 1875 تحت إشراف المعماري الشهير سيغاد. تعتبر وجوده الضخم رمزًا للأهمية الدينية والثقافية في جيجل، حيث يجذب السكان المحليين والزوار على حد سواء للتعجب من تفاصيله المعقدة وجماله الخالد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //86
            ["id" => "5a330f7e-f74a-49f9-b7c8-da07c9c96096", "translation" => "While swimming is not allowed, Achouat beach can still provide a pleasant setting for strolling along the shoreline, enjoying the sea breeze, and admiring the coastal scenery. The beach can also be a suitable spot for fishing enthusiasts or for relaxing on the sand.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "473be714-fa06-4f43-aeb5-9773e4d3bb6d", "translation" => "Bien que la baignade ne soit pas autorisée, la plage d'Achouat peut tout de même offrir un cadre agréable pour se promener le long du rivage, profiter de la brise marine et admirer le paysage côtier. La plage peut également être un lieu propice pour les amateurs de pêche ou pour se détendre sur le sable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2e02cf6c-f6d5-4d35-8424-fe00d83b16cb", "translation" => "بالرغم من عدم السماح بالسباحة، إلا أن شاطئ الأشواط يمكنه مع ذلك أن يوفر إطارًا لطيفًا للتجول على طول الشاطئ، والاستمتاع برياح البحر، والتمتع بالمناظر الساحلية. يمكن أيضًا أن يكون الشاطئ مكانًا مناسبًا لهواة الصيد أو للاسترخاء على الرمال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //87
            ["id" => "9ca3e6ae-f2ad-491c-91b9-27d908d22e39", "translation" => "This monument is an iconic symbol of resistance and the sacrifice of the fighters for independence..", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "afef15c6-c59e-43b9-ad3a-493586071520", "translation" => "Ce monument est un symbole emblématique de la résistance et du sacrifice des combattants pour l'indépendance.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "774f12bb-d911-4adc-acbf-6c06280f5a85", "translation" => "هذا النصب هو رمز بارز للمقاومة والتضحية من قبل المجاهدين من أجل الاستقلال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //88
            ["id" => "a672ade4-d679-476c-8547-8cb595b088d6", "translation" => "This monument is an imposing memorial symbol that pays tribute to the heroes and victims who sacrificed their lives for Algeria's independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3e30bfaa-b780-492f-9238-5820a808f37c", "translation" => "Ce monument est un symbole mémoriel imposant qui rend hommage aux héros et aux victimes qui ont sacrifié leur vie pour l'indépendance de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2130f931-9bf1-49f4-94a5-ee991c0fb572", "translation" => "هذا النصب هو رمز تذكاري يكرّم الأبطال والضحايا الذين قدموا تضحياتهم من أجل استقلال الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //89
            ["id" => "33e92f35-e15d-4959-9761-11ab538adaa5", "translation" => "Whether you're a nature enthusiast, a water sports enthusiast, or simply seeking tranquility, the beach of Beni Ferguene welcomes you with its natural charm and enchanting serenity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "020ce093-d604-409a-8cf0-92141dbac5c7", "translation" => "Que vous soyez un amoureux de la nature, un passionné de sports nautiques ou simplement en quête de tranquillité, la plage de Beni Ferguene vous accueille avec son charme naturel et sa sérénité envoûtante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e7b62ea9-7ce9-45db-b34b-3441d987bd90", "translation" => "سواء كنت من عشاق الطبيعة، أو من عشاق الرياضات المائية، أو ببساطة تبحث عن الهدوء، يرحب بك شاطئ بني فرقان بسحره الطبيعي وهدوئه الساحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //90
            ["id" => "03fa27f6-b988-46f1-a895-db3a186f01f1", "translation" => "A few kilometers from the town of Texenna, you'll find the 'El Maa el Bared' forest located at an altitude of 1,200 meters. It's named after the very cool water from this spring that flows year-round.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "70c3253e-8dfb-4591-9bee-01100e70fea0", "translation" => "À quelques kilomètres de la commune de Texenna, se trouve la forêt ‘El Maa el Bared’ située à 1.200 m d’altitude. Appelée ainsi en raison de l’eau très fraîche de cette source durant toute l'année.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c682a074-89e9-4cd3-bfab-82764334add5", "translation" => "على بعد بضعة كيلومترات من بلدة تاكسنة، تقع غابة 'الماء البارد' على ارتفاع 1200 متر. اسمها مشتق من مياه هذا الينبوع الباردة جدًا التي تتدفق على مدار العام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //91
            ["id" => "b3a1e0e4-8fca-4576-9427-3d04a385c63a", "translation" => "Monument paying tribute to an important figure in Algerian diplomacy during the war of national liberation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "957bccdc-c814-4bd8-935a-82d86ed8277b", "translation" => "Monument rendant hommage à une figure importante de la diplomatie algérienne durant la guerre de libération nationale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ea46c3f7-993d-4cfe-a89d-f143007ea0a0", "translation" => "نصب تكريمي يُكرّم شخصية مهمة في الدبلوماسية الجزائرية خلال الثورة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //92
            ["id" => "e4af3777-d42e-40d3-9ef8-edab73360113", "translation" => "The prehistoric caves of Taza are a true archaeological treasure nestled in the heart of the mountains. It is a site of immeasurable value, preserving the prehistoric heritage of the region and bearing witness to the cultural richness of the area.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bbaa03e0-7bdb-4a00-95b7-06fab66b59db", "translation" => "Les grottes préhistoriques de Taza sont un véritable trésor archéologique nichées au cœur des montagnes. C'est un site d'une valeur inestimable, préservant le patrimoine préhistorique de la région et témoignant de la richesse culturelle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f342c381-04dd-478e-a747-de556f170e38", "translation" => "كهوف تازة القديمة هي كنز أثري حقيقي متواري داخل قلب الجبال. إنه موقع ذو قيمة لا تُقدَّر بثمن، يحتفظ بالتراث القديم للمنطقة ويشهد على الثراء الثقافي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //93
            ["id" => "03bef448-e426-4141-832a-354cacddf007", "translation" => "The Taza national park is a biodiversity gem, housing a wide variety of ecosystems, including dense forests, lush meadows, and wetlands. Its fauna and flora are exceptional, with rare and endemic species finding refuge in this preserved environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fc69ea79-56a0-473e-bc86-39e125c4ce35", "translation" => "Le Parc national de Taza est un joyau de la biodiversité, il abrite une grande variété d'écosystèmes, notamment des forêts denses, des prairies verdoyantes et des zones humides. Sa faune et sa flore sont exceptionnelles, avec des espèces rares et endémiques qui trouvent refuge dans cet environnement préservé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dc8f11cf-6c06-44ab-ab38-bd8ac02d33ab", "translation" => "الحظيرة الوطنية لتازة هو جوهرة في مجال التنوع البيولوجي، حيث يضم مجموعة واسعة من النظم البيئية، بما في ذلك الغابات الكثيفة والمروج الخضراء الندية والمناطق الرطبة. تضمّنت مكوناته وتنوعاته الاستثنائية، مع وجود أنواع نادرة ومحلية الازدهار تجد مأوىً في هذه البيئة المحافظة عليها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //94
            ["id" => "0b5a5623-3239-41b8-86f7-60f358124d83", "translation" => "A peaceful landscape where water flows gently from a modest height, creating a soothing, soft murmur. The surrounding rocks add a touch of character and beauty to this natural space.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e4d103ed-efa7-4d24-98b4-76e533653297", "translation" => "Un paysage paisible où l'eau s'écoule doucement d'une hauteur modeste, créant un léger murmure apaisant. Les rochers environnants ajoutent une touche de caractère et de beauté à cet espace naturel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9d86daff-f70f-495e-93bc-ca188e5bf458", "translation" => "مشهد هادئ حيث تتدفق المياه بلطف من ارتفاع متواضع، مما يخلق همسًا خفيفًا مهدئًا. الصخور المحيطة تضيف لمسة من الطابع والجمال لهذا المكان الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //95
            ["id" => "671f2401-c566-4cec-9373-1ed8d58b2e91", "translation" => "The red beach is a small, pristine paradise. It's a pleasant spot for families with shallow, calm waters, perfect for children to swim safely.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "81490ddc-c5c2-47d3-a6b8-db2dfb940878", "translation" => "La plage rouge est une petite plage paradisiaque très propre, c'est un endroit agréable pour les familles, avec des eaux peu profondes et calmes, idéales pour que les enfants puissent se baigner en toute sécurité. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "aa4700d5-2008-4ced-ae7a-8ae7c36b0377", "translation" => "الشاطئ الأحمر هو شاطئ صغير وجميل جدًا، و مكان لطيف للعائلات، حيث تكون المياه ضحلة وهادئة، مما يجعله مثاليًا للأطفال للسباحة بأمان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //96
            ["id" => "d6af9cb5-df9b-4ac9-b4e3-8b75f8c2c7cd", "translation" => "This facility hosts several activities aimed at promoting local products from the Chréa region: craftsmanship, pottery, and socio-cultural events.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e7e029e7-1384-4db0-8b79-c59644f1b400", "translation" => "Cette infrastructure abrite plusieurs activités visant à promouvoir les produits du terroir de la localité de Chréa : l'artisanat, la poterie et les manifestations socio culturelles. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "56de847e-31cc-4087-8540-3fc3773c1711", "translation" => "تحتضن هذه البنية العديد من الأنشطة التي تهدف إلى تعزيز منتجات المنطقة المحلية في شريعة: الحرف اليدوية وصناعة الفخار والفعاليات الاجتماعية والثقافية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //97
            ["id" => "9bec8c8a-90a0-44ac-8739-7108c3b10c33", "translation" => "A cave located in the heights of the municipality of Djimla, featuring stalactites and stalagmites that captivate visitors. It is the longest and most perplexing cave in the province due to its multiple entrances.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "653590b6-ed91-406f-bbc3-5167745ad9a4", "translation" => "Grotte située sur les hauteurs de la commune de Djimla, avec des stalactites et stalagmites qui font l'admiration des visiteurs. C'est la grotte la plus longue et la plus déroutante de la wilaya en raison de ses multiples accès. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cf446964-e18c-40f7-b43a-854f064620a5", "translation" => "مغارة تقع في المناطق العالية لبلدية جيملة، مع وجود النواقص التي تلفت انتباه الزوار. إنها أطول وأكثر مغارة مربكة في الولاية بسبب وجود مداخل متعددة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //98
            ["id" => "0f6a95c9-739d-4658-a0be-2eaab2f3a557", "translation" => "Whether you're an animal lover, a wildlife enthusiast, or just seeking a rewarding outdoor experience, the Kissir animal park is a must-visit destination. Come and explore the beauty and diversity of the animal kingdom in this enchanting setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "203429f6-0f89-4715-9158-80851eec01a8", "translation" => "Que vous soyez un amateur d'animaux, un passionné de la faune sauvage ou simplement à la recherche d'une expérience enrichissante en pleine nature, le parc animalier de Kissir est une destination incontournable. Venez découvrir la beauté et la diversité du règne animal dans ce cadre enchanteur. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7b6c0f31-efe9-4082-a5bf-e63409793cdd", "translation" => "سواء كنت من محبي الحيوانات، أو عاشقي الحياة البرية، أو مجرد بحثك عن تجربة غنية في الطبيعة، فإن حديقة الحيوانات كسير هي وجهة لا غنى عن زيارتها. تعال واستكشف جمال وتنوع عالم الحيوان في هذا المكان الساحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //99
            ["id" => "3a8a6b6a-cb31-4092-bb9d-f8eb95f1fa63", "translation" => "This site, in the form of a large cave, has been open to the public since 2006 after its development and the creation of large statues embodying the era of dinosaurs and prehistoric man, in addition to bats, along with special lighting. It has become a magnificent tableau that enchants visitors and locals alike.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8a7e9734-aefb-457e-a888-bbc7e3641b2c", "translation" => "Ce site, sous forme d’une grande grotte est ouvert au public depuis en 2006 après son aménagement et la réalisation de grandes statues incarnant l'ère des dinosaures et de l'homme préhistorique, en plus des chauves-souris, ainsi qu'un éclairage spécial. C'est devenu un magnifique tableau qui enchante les visiteurs et les locaux. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0565cb21-5c99-435e-adff-0482bf077743", "translation" => "هذا الموقع، في شكل كهف كبير، تم فتحه للجمهور منذ عام 2006 بعد تطويره وإنشاء تماثيل كبيرة تجسد عصر الديناصورات والإنسان ما قبل التاريخ، بالإضافة إلى الخفافيش، بالإضاءة الخاصة. أصبح ذلك لوحة رائعة تبهر الزوار والمحليين على حد سواء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //100
            ["id" => "dbd2c354-d74d-4d43-971a-f6a08e297317", "translation" => "Visitors from all walks of life will find their happiness at Ain Mchaki. Whether you're a nature lover in search of adventure, an artist seeking inspiration in this picturesque setting, or simply someone looking to escape the daily grind, this place has something to offer everyone.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "26a4aae9-7ea1-4992-8786-0af9c43186d7", "translation" => "Les visiteurs de tout horizon trouveront leur bonheur à Ain Mchaki. Que vous soyez un amoureux de la nature en quête d'aventure, un artiste cherchant l'inspiration dans ce décor pittoresque, ou simplement quelqu'un qui souhaite échapper à la routine quotidienne, cet endroit a quelque chose à offrir à chacun. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "11eb06a5-c26a-4a1e-82ac-18feef98cbcd", "translation" => "سواء كنت من عشّاق الطبيعة بحثًا عن المغامرة، أو فنان يبحث عن الإلهام في هذا المناظر الخلابة، أو حتى مجرد شخص يتمنى الهروب من الروتين اليومي، فإن هذا المكان يحمل شيئًا لكل فرد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //101
            ["id" => "61c82c2d-ae6c-4ef6-9f40-745f694c18d1", "translation" => "The Choba Municipium site, dating back to the Roman era, is a valuable testament to the history of the city. Founded by the Roman emperor Octavius in the last quarter of the first century BC, this Roman city is mainly located to the west of the city wall.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bf39efc5-eee9-4af3-a716-3a41435b8bcb", "translation" => "Le site de Choba Municipium, datant de l'époque romaine, est un témoignage précieux de l'histoire de la ville. Fondée par l'empereur romain Octavius au dernier quart du premier siècle avant J.-C., cette ville romaine se trouve principalement à l'ouest du mur de la ville. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "212ad3b8-fb09-473a-aa63-6f1fcdece226", "translation" => "موقع شوبا مونيسيبيوم، الذي يعود إلى عصر الرومان، هو شاهد قيم على تاريخ المدينة. تأسست هذه المدينة الرومانية بواسطة الإمبراطور الروماني أوكتافيوس في الربع الأخير من القرن الأول قبل الميلاد، وتقع هذه المدينة بشكل رئيسي إلى الغرب من سور المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //102
            ["id" => "dc3afa39-8198-4723-8537-f398ceb0b5d3", "translation" => "Located within the Akfadou forest massif at an altitude of 1200 meters, the black lake derives its name from the color of its waters. Indeed, it is a lake surrounded by very dense vegetation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5ac6f230-bc4e-4e04-adc4-017fcf884869", "translation" => "Situé en plein massif forestier d'Akfadou à 1200 m d’altitude. Le lac noir détient son nom du fait de la couleur de ses eaux, il s'agit en effet d'un lac entouré d'une végétation très dense autour de lui. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "150545f2-c4d9-4bbe-99e7-b4e2f8e33aac", "translation" => "يقع بالضبط داخل غابة أكفادو على ارتفاع 1200 مترًا، ويأخذ بحيرة السوداء اسمها من لون مياهها. في الواقع، إنها بحيرة محاطة بنباتات كثيفة جدًا حولها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //103
            ["id" => "4c1adaa8-0941-4939-80c6-354590fd07fa", "translation" => "The kasbah of Béjaïa is one of the most significant tourist attractions in the city. It is a fortress dating back to the Spanish occupation of the city and exhibits characteristics of European architecture.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c2ceb880-0a3c-4592-8d0c-c09dbbb1b9f9", "translation" => "La casbah de Béjaïa est l'un des lieux touristiques les plus importants de la ville. C'est une forteresse qui remonte à l’occupation espagnole de la ville et porte les caractéristiques de l'architecture européenne. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fe8d0233-d022-4d97-b49f-b6eeae20a1a0", "translation" => "قصبة بجاية هي واحدة من أهم معالم الجذب السياحي في المدينة. إنها قلعة تعود إلى الاحتلال الإسباني للمدينة وتحمل سمات الهندسة المعمارية الأوروبية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //104
            ["id" => "d39088c2-2071-49e4-b9ea-2a06eab328be", "translation" => "The bust of Ibn Khaldun is a magnificent tribute to this exceptional scholar and an invitation to delve into his timeless ideas and writings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "90a2076a-9442-4db8-a4ea-a037a5445d96", "translation" => "Le buste d'Ibn Khaldoun est un hommage magnifique à cet érudit exceptionnel et une invitation à plonger dans ses idées et ses écrits intemporels. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cefbccc8-bf24-4c57-a298-5525db0bdfb6", "translation" => "تمثال ابن خلدون هو تكريم رائع لهذا العالِم الاستثنائي ودعوة لاستكشاف أفكاره وكتاباته الخالدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //105
            ["id" => "544ecb7e-7bec-4a22-a2a6-466c2cc7c530", "translation" => "Mount Takoucht is the highest mountain peak in the Bejaia province, reaching an elevation of approximately 1,896 meters. It's an untouched natural site where tourists can engage in mountain tourism and sports.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "72e8d8ec-8d5e-4bde-af3b-a117c4da2ab0", "translation" => "Le mont Takoucht est le plus haut sommet montagneux de la wilaya de Bejaia, culminant à environ 1. 896 mètres d'altitude. C’est un site naturel vierge où l’on peut pratiquer le tourisme et les sports de montagne. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e9be067b-dfa0-423c-85cd-59551927d94e", "translation" => "جبل تاكوشت هو أعلى قمة جبلية في ولاية بجاية، حيث تصل ارتفاعه إلى حوالي 1.896 مترًا. إنه موقع طبيعي نقي حيث يمكن للسياح ممارسة السياحة الجبلية والرياضات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //106
            ["id" => "7ecdf4fd-6898-4810-8705-7645bc0e4d6f", "translation" => "The Gouraya national park is natural jewel located in the municipality of Bejaia. It annually welcomes numerous tourists, especially during the summer season. Its sandy beaches, cliffs, and crystal-clear waters contribute to its appeal.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d4d00f1b-663a-4861-83e7-47793c9bda58", "translation" => "Le parc national du Gouraya est joyau naturel situé dans la commune de Béjaïa .Il accueille annuellement de nombreux touristes, surtout en période estivale. Ses plages de sable, ses falaises et ses eaux cristallines participent à son attrait. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b88bbe15-2065-47bf-aa1f-96be870e6d02", "translation" => "الحظيرة الوطنية قورايا هو جوهرة طبيعية يقع في بلدية بجاية. يستقبل سنويًا العديد من السياح، خاصة خلال فصل الصيف. شواطئه الرملية والمنحدرات ومياهه الصافية تساهم في جاذبيته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //107
            ["id" => "72337e73-2346-4442-8906-9bafd271cec1", "translation" => "Located at the highest peak of the mountain at 672 meters above sea level, a strategic position that gives it significant importance, as the fort has, throughout the ages, served as an excellent vantage point, protecting the city from any foreign incursions, especially from the sea, and providing a commanding view of the entire region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b9cd5664-fe3f-4498-8d4d-6d9557ebc013", "translation" => "Située au pic le plus élevé de la montagne à 672 m au-dessus de la mer, une position stratégique qui lui confère une importance considérable, car le fortin constitua à travers les âges, un point de vigie par excellence vu qu’il protégeait ainsi la ville de toute incursion étrangère notamment du côté de la mer et qui permet de dominer la région entière. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ec28604c-08f7-4b18-98c3-8d9300fc62b8", "translation" => "موجود على أعلى ذروة في الجبل على ارتفاع 672 مترًا فوق مستوى سطح البحر، وهو موقع استراتيجي يمنحه أهمية كبيرة، حيث أن الحصن، على مر العصور، كان نقطة مراقبة ممتازة، تحمي المدينة من أي تسلل أجنبي، وخصوصًا من البحر، وتوفير رؤية قائمة للمنطقة بأكملها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //108
            ["id" => "9e6fabbe-5511-4418-8632-38a158325975", "translation" => "The Toudja water museum is a complex with historical, cultural, scientific, educational, and touristic significance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d3068c1d-1473-4bc8-986d-f1b6a1ff92e4", "translation" => "Le musée de l'eau de Toudja est un ensemble à caractère historique, culturel, scientifique, pédagogique et touristique. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4ba4c339-1abd-4175-b07f-a6c3f31d9f34", "translation" => "متحف الماء في توجة هو مجموعة تمتاز بأهمية تاريخية ,ثقافية ,علمية ,تعليمية وسياحية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //109
            ["id" => "670ff1a9-865f-49c9-aa98-3d6eaa52d0d5", "translation" => "The Bordj Moussa museum is a captivating place that houses historical and cultural treasures. Located within an imposing medieval fortress, the museum offers breathtaking views of the city and the sea. Inside, visitors are transported through time with a diverse collection of objects and artifacts, including ceramics, ancient weapons, jewelry, and archaeological pieces.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "88fa06f3-02d2-4dc3-ab8d-1d6fc9eb593f", "translation" => "Le musée Bordj Moussa est un lieu captivant qui abrite des trésors historiques et culturels. Situé dans une forteresse médiévale imposante, le musée offre une vue imprenable sur la ville et la mer. À l'intérieur, les visiteurs sont transportés à travers le temps, à travers une collection variée d'objets et d'artefacts, notamment des céramiques, des armes anciennes, des bijoux et des pièces archéologiques. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2ded2ac4-1e6a-4421-b7b6-b1f2fc1b5e30", "translation" => "متحف برج موسى هو مكان ساحر يضم كنوزًا تاريخية وثقافية. يقع المتحف داخل قلعة ويوفر إطلالات رائعة على المدينة والبحر. بالداخل، يتم نقل الزوار عبر الزمن من خلال مجموعة متنوعة من الأشياء والآثار، بما في ذلك السيراميك، والأسلحة القديمة، والمجوهرات، والقطع الأثرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //110
            ["id" => "21bf203c-b587-4b13-b71c-aea65c2264b2", "translation" => "The museum of the mujahid is an iconic place dedicated to the memory of the country's struggle for independence. It houses an impressive collection of artifacts, photographs, and historical documents depicting the period of the national liberation war.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9cb468df-ea9d-4142-bfa8-11f1f7e59184", "translation" => "Le musée el Moudjahid est un lieu emblématique dédié à la mémoire de la lutte pour l'indépendance du pays. Il abrite une collection impressionnante d'artefacts, de photographies et de documents historiques relatant la période de la guerre de libération nationale. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2bb68b08-cb5d-4a45-a41d-dff565c136b7", "translation" => "متحف المجاهد هو مكان رمزي مخصص لذكرى نضال البلاد من أجل الاستقلال. يحتضن مجموعة رائعة من القطع الأثرية والصور والوثائق التاريخية التي تصور فترة حرب التحرير الوطني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //111
            ["id" => "7cf38dcc-2e02-4960-976f-28283f548cc5", "translation" => "The museum consists of two exhibition halls, a specialized library, and a conference room. In short, it is a fascinating place dedicated to the study and understanding of Earth sciences.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b372bc8b-d462-46d4-9b9d-c47d93cbceda", "translation" => "Le musée est con­sti­tué de deux salles d’exposition, d’une bib­lio­thèque spé­cial­isée et d’une salle de con­férence. En somme un lieu fascinant dédié à l'étude et à la compréhension des sciences de la Terre. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2231010e-324a-424c-8489-5549bdc1c2ae", "translation" => "المتحف مكون من غرفتي عرض ومكتبة متخصصة وقاعة للمؤتمرات. بإختصار، إنه مكان رائع مكرس لدراسة وفهم علوم الأرض.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //112
            ["id" => "2a148805-0629-4578-a911-174df41ee943", "translation" => "This center features a history museum, a microsystems and water cycle museum (specializing in marine and lacustrine biodiversity), a mini laboratory, a library, a projection room, a pedagogical nursery, and a computer room.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ff2372ec-c34a-4cc2-b1b5-7c82038aa9e2", "translation" => "Ce centre est doté d’un musée de l’histoire, d’un musée des microsystèmes et du cycle de l’eau (spécialisé dans la biodiversité marine et lacustre), d’un mini laboratoire, d’une bibliothèque, d’une salle de projection, d’une pépinière pédagogique et d’une salle informatique. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "553ed5d4-bd19-482f-8aa1-105efdc058cf", "translation" => "هذا المركز يحتوي على متحف للتاريخ، ومتحف للأنظمة الصغيرة ودورة المياه (متخصص في التنوع البيئي البحري والبحيري)، ومختبر صغير، مكتبة، غرفة عرض وغرفة كمبيوتر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //113
            ["id" => "13a784fe-cc80-476a-a194-a3f7e4a2a356", "translation" => "The koubba, or zaouïa of Sidi Touati, was once a school that attracted many scholars from various parts of the world. It was identified during the Hammadite period as a holy place that drew visitors and served as an 'unconventional' pilgrimage site.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e83aa6b2-3426-4f84-ad0e-7f11237eaa54", "translation" => "La Koubba, ou zaouïa de Sidi Touati a été une école qui a attiré nombre de scientifiques de différentes régions du monde identifié à l’époque Hammadite comme lieu saint qui capte les visites et fait office de lieu de pèlerinage “Atypique”. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "757a2aac-4c8f-4945-8c13-f4c2a20d3e2f", "translation" => "القبة، أو الزاوية الخاصة بسيدي تواتي، كانت في السابق مدرسة جذبت العديد من العلماء من مختلف أنحاء العالم. تم التعرف عليها خلال فترة الحماديين كمكان مقدس جذب الزوار وكانت تعتبر مكانًا 'غير تقليدي' للزيارة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //114
            ["id" => "4b47cdee-acc2-4f0b-93ec-3af3cbaf2900", "translation" => "The Sarrasine gate is a historic monument in the city of Béjaïa and one of the oldest preserved gates in the Maghreb.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cd27dc1d-7920-4cd8-bf20-5105db404e37", "translation" => "La porte sarrasine est un monument historique de la ville de Béjaïa et l'une des plus anciennes portes conservées au Maghreb. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7bd50dbf-00c5-431f-8c02-7f7ab36e9d15", "translation" => "باب البحر هي نصب تاريخي في مدينة بجاية واحدة من أقدم الأبواب المحفوظة في المغرب.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //115
            ["id" => "a41fb553-fc8c-4d49-9be6-eaae52f3f3de", "translation" => "The site is located in the historic village of Saddouk Oufella and includes the former mausoleum of Sheikh Belheddad and his sons, as well as his residence with large rooms where followers of the Rahmania order gather.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "afd0c69e-e316-4585-ba2c-ed9ef5f238db", "translation" => "Le site se trouve dans le village historique de Saddouk Oufella et comprend l'ancienne mausolée du Cheikh Belheddad et de ses fils, sa résidence qui dispose de grandes salles dans lesquelles se rassemblent les adeptes de l'Ordre Rahmania.  ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2f153a99-058d-4ffc-8faf-4d262280a61c", "translation" => "يقع في القرية التاريخية صدوق أوفلا ويشمل الضريح القديم للشيخ بلحداد وأبنائه، بالإضافة إلى إقامته السكنية التي تحتوي على غرف كبيرة حيث يجتمع أتباع الطريقة الرحمانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //116
            ["id" => "7a412a95-6478-442e-bc43-c7c6860bb205", "translation" => "The zawiya has a long history in the field of popularizing sciences and religious education. It consists of a mosque, dormitories for students, and a restaurant.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d07add44-b821-4db8-945d-1959b1b9f92c", "translation" => "La zawiya possède une longue histoire dans le domaine de la vulgarisation des sciences et de l’enseignement religieux. Elle se compose d'une mosquée, de dortoirs pour les étudiants et d'un restaurant. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3a4cf53d-8d1c-4dbd-9130-ddb6541dd191", "translation" => "الزاوية لها تاريخ طويل في مجال تعميم العلوم وتعليم الدين. تتألف من مسجد وبيوت نوم للطلاب ومطعم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //117
            ["id" => "23462e91-d106-4037-887f-30b7dd41988a", "translation" => "Historical site where the soummam congress was held. This museum is a place of memory, reflection, and commemoration, preserving and transmitting the history of the struggle for Algeria's freedom.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fed7ffe5-f3fd-4174-860b-ba0aeb0a3224", "translation" => "Lieu historique où s’est tenu le congrès de la soummam. Ce musée est un lieu de mémoire, de réflexion et de commémoration, permettant de préserver et de transmettre l'histoire de la lutte pour la liberté de l'Algérie.  ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c203ba0d-73d7-49d6-abd7-14633f5244d7", "translation" => "الموقع التاريخي حيث عُقد مؤتمر الصومام. هذا المتحف هو مكان للذاكرة والتفكير والاحتفال، يسمح بالمحافظة ونقل تاريخ النضال من أجل حرية الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //118
            ["id" => "dac334df-0ca5-4d3b-acbb-ec0639178511", "translation" => "An access gate dating back to the Hammadid period, spared by time, today all that remains is a wall built of large stones.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "630812d0-8764-4ba0-b0a8-0f82eaa29878", "translation" => "Une porte d’accès datant de l’époque hammadite, épargnée par le temps, aujourd’hui il n’en reste qu’une muraille construite en pierres de grosse taille.  ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ae3e6071-3fc4-4e0b-a797-8ee571b80d14", "translation" => "بوابة تعود إلى العصر الحمادي، نجت من تأثير الزمن، اليوم، كل ما تبقى هو جدار بُني من الحجارة الكبيرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //119
            ["id" => "7d8a5545-3801-4f7d-8a81-645c35a80ac8", "translation" => "The colony of Tubusuptu was founded by the Roman Emperor Augustus in the first century AD to serve as a center for retired Roman soldiers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8eeff9c4-a0fb-4a05-962f-8af347841be4", "translation" => "La colonie de Tubusuptu a été fondée par l'empereur romain Auguste au premier siècle de notre ère pour servir de centre pour les anciens militaires romains. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5f9cff2b-6230-4b8f-be9a-00fc8743637f", "translation" => "مستوطنة توبوسوبتو تأسست على يد الإمبراطور الروماني أوغسطس في القرن الأول الميلادي لتكون مركزًا للجنود الرومان المتقاعدين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //120
            ["id" => "fbc11de7-db83-40b7-bb42-8afd3e06f9f4", "translation" => "Remains of an aqueduct that supplied water to the city of Saldae (nowadays Béjaïa).", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1f4d7459-9e8d-432b-93ec-b8b1f5920a1b", "translation" => "Vestiges d’un aqueduc qui permettait l’approvisionnement en eau de la ville de Saldae (actuelle Béjaïa).  ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4225263a-e034-4025-92d2-f142129d045e", "translation" => "آثار القناة المائية الرومانية التي كانت تمد المدينة سالداي (بجاية حاليا) بالماء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //121
            ["id" => "7f5e3bd3-5067-4294-a510-24d70d12dfdc", "translation" => "Adjacent to Abane Ramdane airport, it hosts around 17 species of water birds during the winter, mainly using it as a breeding site.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "11f743f2-353f-468c-9634-eb70c4162210", "translation" => "Adjacent à l’aéroport Abane Ramdane. Il abrite environs 17 espèces d’oiseaux d’eau en hiver, qui l’utilise surtout comme site de reproduction.  ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4bf9a4d4-1a48-4dcc-a1ec-23dd3d9b0b88", "translation" => "مجاور لمطار أبان رمضان. يضم حوالي 17 نوعًا من طيور المياه خلال فصل الشتاء، حيث يستخدمونه في الغالب كموقع للتكاثر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //122
            ["id" => "f189bc20-bfde-4a6d-bd32-e72cc8f2b356", "translation" => "The kalâa of Beni Abbès, is an important village, an ancient city, and the capital of a local kingdom. It has become a popular tourist destination for all those who discover the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0880a932-3559-4cd5-b4cf-c24515780579", "translation" => "La Kalâa des Beni Abbès, est un important village, une ancienne cité et capitale d'un royaume local. Elle est devenue une destination touristique prisée pour tous ceux qui découvrent la région.  ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f2431e55-15f7-4b89-bb9f-04fb8f23cf27", "translation" => "قلعة بني عباس هي قرية هامة ومدينة قديمة وعاصمة مملكة محلية. أصبحت وجهة سياحية مشهورة لجميع أولئك الذين يكتشفون المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //123
            ["id" => "39b5acaa-3f26-4e24-83c1-528406845884", "translation" => "A remarkable vestige from the Roman period, where one can admire the ingenuity and creativity of the Romans in their funerary architecture.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "723a0f15-ba0b-4d1d-ae3f-8e17e40b52a8", "translation" => "Vestige remarquable de la période romaine, où l'on peut admirer l'ingéniosité et la créativité des Romains dans leur architecture funéraire.  ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b9760709-3ea0-4523-b47c-dc8399724c5a", "translation" => "بقايا ملحوظة من العصر الروماني، حيث يمكن للزائر أن يعجب بفطرة وإبداع الرومان في عمارتهم الجنائزية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //124
            ["id" => "9bce0698-55f9-4d76-b4b7-8576dd173860", "translation" => "Cap Carbon is a site of exceptional natural beauty. It is located north of the bay of Béjaïa and offers breathtaking views of the Mediterranean Sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6cfe310b-1304-4f6c-aee2-2503ac3f84b0", "translation" => "Le cap Carbon est un site naturel d'une beauté exceptionnelle. Il est situé au nord de la baie de Béjaïa et offre des panoramas à couper le souffle sur la mer Méditerranée. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7b1d5752-a8a1-43e0-ab7c-977f32ffe31f", "translation" => "كاب كاربون هو موقع طبيعي ذو جمال استثنائي. يقع شمال خليج بجاية ويقدم مناظر خلابة للبحر الأبيض المتوسط.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //125
            ["id" => "98878194-25c3-486c-9339-dac1be438841", "translation" => "This place served as a detention camp during the war of liberation and was used by the colonial army as a detention and torture center.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2e725c6b-86eb-4863-8b29-b3fc77177819", "translation" => "Ce lieu a servi de camp d’emprisonnement durant la guerre de libération et a été utilisé par l’armée coloniale comme centre de détention et de torture. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0f73bcd3-b0d8-4347-9128-441c28cd5bd5", "translation" => "هذا المكان كان يستخدم كمعسكر احتجاز خلال حرب التحرير واستخدمته الجيش الاستعماري كمركز للاحتجاز والتعذيب.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //126
            ["id" => "546c040e-1098-4853-ba50-7131f694e159", "translation" => "This fort, likely of Hammadite origin, has always played a crucial role in the city's defensive system. Today, it is a prominent tourist attraction.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "20227e51-9b86-4db6-a415-4b5f7c688751", "translation" => "Ce fort, probablement d’origine Hammadite a toujours occupé une place essentielle dans le dispositif défensif de la ville. Il est aujourd’hui une attraction touristique de premier plan ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ce31ef5e-3ca7-4f7a-a4e7-ce208340689f", "translation" => "هذه القلعة، المحتمل أن تكون من أصل حمادي، دائمًا ما كانت تلعب دورًا حاسمًا في النظام الدفاعي للمدينة. اليوم، إنها معلم سياحي بارز.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //127
            ["id" => "0fc6b82d-eec0-4738-bbf5-f1ca8782752f", "translation" => "The theatre of Béjaïa is a cultural gathering place that contributes to the artistic richness of the region and provides unforgettable moments for lovers of the performing arts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6bc21e7d-a626-486f-a385-6791bb8065e0", "translation" => "Le théâtre régional de Béjaïa est un lieu de rassemblement culturel qui contribue à la richesse artistique de la région et offre des moments inoubliables aux amateurs d'arts vivants. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "002be11c-e584-4520-8c15-4d9b25c10115", "translation" => "مسرح بجاية هو مكان للتجمع الثقافي يسهم في الثراء الفني للمنطقة ويقدم لعشاق الفنون الحية لحظات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //128
            ["id" => "e932e502-8d03-4f0c-85b9-6fbc6b094290", "translation" => "Citadel Temzizdekt, it was built by the Zianids in 1327 on the orders of Sultan Abou Tachfin of Tlemcen during the siege of Béjaïa.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "38e0dbdf-10f4-4e75-9012-ee5758ff51a5", "translation" => "Citadelle Temzizdekt, elle a été construite par les Zianides en 1327 sur l’ordre du Sultan de Tlemcen Abou Tachfin lors du siège de Béjaïa. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c3ebab94-534b-47ad-9473-501243fa1975", "translation" => "القلعة تمزيزدكت، تم بناؤها من قبل الزيانيين في عام 1327 بأوامر من سلطان تلمسان أبو تشفين خلال حصار بجاية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //129
            ["id" => "cd3da9bc-d88e-4908-99fb-3049c85035fb", "translation" => "The Aokas caves offer a unique experience for nature enthusiasts, where natural beauty and environmental preservation harmoniously come together.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d239ced2-6b9c-4fc6-bd8a-8f6d4f087b5f", "translation" => "Les grottes d'Aokas offrent une expérience unique pour les amateurs de nature, où la beauté naturelle et la préservation de l'environnement se rencontrent harmonieusement. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "41a8f8cb-ad35-46d5-b292-85e4ae626136", "translation" => "كهوف أوقاس تقدم تجربة فريدة لعشاق الطبيعة، حيث تجتمع الجمال الطبيعي والحفاظ على البيئة بانسجام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //130
            ["id" => "7f3ca488-70a8-49e6-a60e-6a115b3caadd", "translation" => "The Countess castle is an iconic place in Aokas that bears witness to the region's rich history and attracts visitors seeking cultural discoveries. The Youth and Sports Directorate of Béjaïa has transformed this beautiful architectural work into a youth hostel after the rehabilitation of the premises using the same construction materials from the period, and an extension of more than 3000m2.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6c7271fb-89db-4462-80a5-1f9592850339", "translation" => "Le Château de la Comtesse est un lieu emblématique d’Aokas qui témoigne du riche passé de la région et qui attire les visiteurs en quête de découvertes culturelles. La direction de la jeunesse et des sports de Béjaïa a transformé cette belle œuvre architecturale en auberge de jeunesse après une réhabilitation des lieux avec les mêmes matériaux de construction de l’époque, et une extension de plus de 3000m2. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fa6989b7-e047-485f-af9d-494cd2994409", "translation" => "قصر الكونتيسة هو مكان أيقوني في أوقاس يشهد على تاريخ الغني للمنطقة ويجذب الزوار الباحثين عن اكتشافات ثقافية. قامت مديرية الشباب والرياضة في بجاية بتحويل هذا العمل المعماري الجميل إلى نزل شباب بعد ترميم المكان باستخدام نفس مواد البناء ذلك الوقت, وإضافة توسعة تزيد عن 3000 متر مربع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //131
            ["id" => "44113137-6103-4882-a7c1-e7b132d71165", "translation" => "An ideal place to connect with nature, enjoy the surrounding beauty, and rejuvenate while contemplating this impressive natural phenomenon.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "feeac376-367f-46eb-b542-cbe315793c83", "translation" => "Un lieu idéal pour se connecter avec la nature, profiter de la beauté environnante et se ressourcer en contemplant ce phénomène naturel impressionnant. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8db83cfd-3707-4752-a829-87e9b2253da7", "translation" => "مكان مثالي للاتصال بالطبيعة، الاستمتاع بجمال المحيط، و الاسترخاء أثناء التأمل في هذه الظاهرة الطبيعية الرائعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //132
            ["id" => "0de13748-27a3-487d-986c-88fb5ea20719", "translation" => "Tifernine waterfalls provide a breathtaking visual spectacle, inviting visitors to relax, rejuvenate, and connect with nature in this pristine paradise.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ded8483e-18ac-4274-b8a3-9eea328ef548", "translation" => "La Cascade de Tifernine offre un spectacle visuel époustouflant, invitant les visiteurs à se détendre, à se ressourcer et à se connecter avec la nature dans ce paradis préservé. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0be0ed2f-66d2-4020-b35b-1930178d6d99", "translation" => "شلالات تيفرنين تقدم عرضًا بصريًا مذهلاً، داعيًا الزوار إلى الاسترخاء والتجديد والتواصل مع الطبيعة في هذا الجنة النقية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //133
            ["id" => "24ed5865-5737-4443-a42a-d2844ddffc2e", "translation" => "The atmosphere in this paradisiacal place is filled with freshness and serenity, with the gentle murmur of water blending with the sounds of the surrounding nature. The surroundings are covered with lush, green vegetation, creating a picturesque setting for this natural wonder.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bb998e19-1bd2-4762-9664-c67f296bde14", "translation" => "L'atmosphère qui règne dans ce lieu paradisiaque est empreinte de fraîcheur et de sérénité, avec le doux murmure de l'eau qui se mêle aux sons de la nature environnante. Les environs sont couverts d'une végétation dense et verdoyante, créant un cadre pittoresque pour cette merveille naturelle. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "564578c2-c583-48ea-a1c8-7fb8a3fc35c5", "translation" => "الأجواء في هذا المكان مليئة بالنضارة والسكينة، مع همس هادئ للمياه يمتزج مع أصوات الطبيعة المحيطة. وتغطي المناطق المحيطة نباتات خصبة وخضراء بكثافة، مما يخلق إعدادًا جميلًا لهذه العجبة الطبيعية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //134
            ["id" => "7c4121c6-fd68-42db-b0ef-604cc2be0e69", "translation" => "The gorges of Kherrata are a stunning natural wonder, where the steep and imposing cliffs that surround the gorges create a majestic panorama.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ce916417-6825-44ab-81b7-7927d9020154", "translation" => "Les gorges de Kherrata sont une merveille naturelle saisissante, où les falaises escarpées et imposantes qui entourent les gorges créent un panorama majestueux. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3d8f66dd-9f48-46a1-8603-b2922471878d", "translation" => "مضائق خرّاطة هي عجبة طبيعية رائعة، حيث الجدران الصخرية الشاهقة و المهيبة التي تحيط بالمضائق تخلق منظرًا ساميًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //135
            ["id" => "5f273693-a44a-4843-92a5-5e52ed4a58aa", "translation" => "This imposing stone bastion dates back to the year 1837. It provides visitors with a breathtaking view that inspires admiration and contemplation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dce3dc8e-48c1-49ec-8396-f5820045ecd3", "translation" => "Ce bastion en pierre imposant date de l’an 1837. Il offre aux visiteurs une vue imprenable qui inspire admiration et contemplation. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2163073d-90e4-41b0-b5b2-fa9fd298a564", "translation" => "هذه القلعة الضخمة تعود إلى عام 1837. إنها تقدم للزوار إطلالة رائعة تلهم الإعجاب والتأمل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //136
            ["id" => "b0c1bbf9-ac0e-4c92-8f2a-8f9e1213c6e3", "translation" => "It was the most advanced line of defense for the French army in the campaign, with Fort Clauzel further down and even further down towards the plain, the Salomon Tower, built to prevent attacks by local tribes that made regular incursions in the years following colonization.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dffe1c9c-6016-4e78-b907-2611d617d5a1", "translation" => "C’était la ligne la plus avancée des défenses de l’armée française dans la campagne, avec plus bas le fort Clauzel et encore plus bas vers la plaine, la tour Salomon, construite pour empêcher les attaques des tribus locales qui faisaient des incursions régulières pendant les années qui ont suivis la colonisation. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b76b2f54-579a-42a1-8bf5-c2406958e5fd", "translation" => "كانت هذه الخط الدفاعي الأكثر تقدمًا للجيش الفرنسي في الحملة، حيث يقع فيها قلعة كلوزيل أسفلها وأبعد من ذلك نحو السهولة، برج سليمان، الذي تم بناؤه لمنع هجمات القبائل المحلية التي كانت تقوم بغزوات منتظمة في السنوات التي تلت الاستعمار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //137
            ["id" => "42d2bb00-3b97-4b49-b6fc-f795fc84fc7d", "translation" => "The craft gallery is a place where local craftsmanship comes to life. The shelves are filled with beautiful handmade pieces, ranging from colorful pottery to delicate weavings and finely crafted wooden sculptures. Visitors can admire the diversity of techniques and materials used, as well as the patterns and symbols unique to the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9efb5e2e-9517-4472-8886-360ee5f9dad9", "translation" => "La galerie d'artisanat est un lieu où l'artisanat local prend vie. Les étagères sont remplies de magnifiques pièces faites à la main, allant des poteries colorées aux tissages délicats en passant par les sculptures en bois finement travaillées. Les visiteurs peuvent admirer la diversité des techniques et des matériaux utilisés, ainsi que les motifs et les symboles propres à la région. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d56fa0f5-6002-46a7-b785-8e5d06ec19ad", "translation" => "مركز الحرف هو مكان يحيا فيه الحرف اليدوية المحلية. الرفوف ممتلئة بقطع يدوية جميلة متنوعة، تتراوح بين الفخار الملون إلى النسج الرقيق والمنحوتات الخشبية الدقيقة. يمكن للزوار أن يعجبوا بتنوع التقنيات والمواد المستخدمة، فضلاً عن الأنماط والرموز الفريدة للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //138
            ["id" => "98646a94-96c6-4e73-81e1-45b0121497ae", "translation" => "A fascinating place where science and biology come together. Specialized in terrestrial biodiversity (mammals, birds of prey, reptiles, passerines, exotic animals, etc...)", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ea12cb3c-e425-4c4e-b2a5-7a6493d8d4ed", "translation" => "Un lieu fascinant où la science et la biologie se rencontrent. Spécialisé dans la biodiversité terrestre (mammifères, rapaces, reptiles, passereaux, animaux exotiques etc…) ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7cf89e14-1a61-47bd-9036-7e8e49c7f952", "translation" => "مكان ساحر متخصص في التنوع البيئي على اليابسة (الثدييات، والطيور الجارحة، والزواحف، والعصافير، والحيوانات الاستوائية، إلخ...)", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //139
            ["id" => "33d835eb-c4d1-4e4f-a6d8-0b40a7d155b6", "translation" => "The Bejaïa house of culture is a dynamic place that hosts a variety of artistic and cultural activities, including art and craft exhibitions, theatrical performances, concerts, and lectures.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c7f58c79-590d-40d0-b14f-ef6de3ef985c", "translation" => "La maison de la culture de Béjaïa est un lieu dynamique qui abrite une variété d'activités artistiques et culturelles, allant des expositions d'art et d'artisanat aux représentations théâtrales, en passant par des concerts et des conférences. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9f4bb12b-0296-48f3-b6d9-ad150c907c06", "translation" => "دار الثقافة في بجاية مكان ديناميكي يستضيف مجموعة متنوعة من الأنشطة الفنية والثقافية، بدءًا من معارض الفن والصناعة اليدوية وصولاً إلى العروض المسرحية والحفلات الموسيقية والمحاضرات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //140
            ["id" => "5a4fff0e-f7e8-4b03-b225-4817bdb8df42", "translation" => "It is a cultural heritage that captures attention and evokes a connection to history and tradition.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f705a3e8-eb20-460f-bab7-d49f9213e6be", "translation" => "Il s'agit d'un héritage culturel qui attire les regards et évoque une connexion avec l'histoire et la tradition. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "142c6006-f965-4de9-9006-fad39a6b0c85", "translation" => "هذا التراث الثقافي يلفت الأنظار ويثير اتصالًا بالتاريخ والتقاليد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //141
            ["id" => "053e7ee1-6fa6-4dcb-bb12-78972e41ab48", "translation" => "The pirates cave dates back to the prehistoric period and also served as a hiding place and base for pirates in the region to plunder the cargo of ships passing through the Bay of Bejaïa.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f4d6dd79-987a-4e2e-b6a8-563f897c3145", "translation" => "La grotte des pirates remonte à la période préhistorique, elle a aussi servi comme cachette et base pour les corsaires de la région afin de délester les bateaux traversant le golf de Béjaïa de leur marchandise.  ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "657b897b-cb92-4d73-b770-dbc9ca60220c", "translation" => "كهف القراصنة يعود إلى العصور ما قبل التاريخ، وكان يستخدم أيضًا كمخبأ وقاعدة للقراصنة في المنطقة لنهب حمولة السفن التي تمر عبر خليج بجاية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //142
            ["id" => "e6ca4338-ffca-4421-9064-ac051f2322fd", "translation" => "The salt extraction basins were likely created and developed by the Romans. Today, these remains bear witness to the historical heritage and provide a fascinating glimpse into Roman life and their sophisticated production techniques.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0790c407-f93c-40dd-8e8f-5222088086c9", "translation" => "Les bassins servant à l'extraction du sel ont été réalisés et aménagés probablement par les romains. Aujourd'hui, ces vestiges témoignent du patrimoine historique et offrent un aperçu fascinant de la vie romaine et de leurs techniques de production sophistiquées. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f715fd26-8b21-4a0f-a150-649be4b67d23", "translation" => "تم إنشاء حوض استخراج الملح على الأرجح وتطويرها على يدي الرومان. في الوقت الحالي، تشهد هذه البقايا على التراث التاريخي وتقدم نظرة جذابة إلى حياة الرومان وتقنيات إنتاجهم المتطورة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //143
            ["id" => "d5ce712d-15b1-46aa-b275-4400901f5ee0", "translation" => "Eroded rock formations create natural pools where you can swim and cool off, making it an ideal place to relax, rejuvenate, and connect with the raw beauty of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ca5d60b0-b169-44a6-a625-ead9708f36f7", "translation" => "Les formations rocheuses érodées créent des piscines naturelles où l'on peut se baigner et se rafraîchir. un lieu idéal pour se détendre, se ressourcer et se connecter à la beauté brute de la nature. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9532d707-04c8-4dd6-8a0d-ef7f1dc1e240", "translation" => "تكون تكوينات الصخور المتآكلة بركًا طبيعية يمكن السباحة فيها وتبريد الجسم. إنه مكان مثالي للاسترخاء واستعادة النشاط والتواصل مع جمال الطبيعة الخامة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //144
            ["id" => "a23781ce-4bc2-4962-8c57-24b42e719f4a", "translation" => "A typical beach of the region, it's the perfect place to relax, sunbathe, and rejuvenate in a tranquil and enchanting setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b8fd02e7-c246-4f0c-80fb-ed50b85d1372", "translation" => "Une plage typique de la région qui est l'endroit idéal pour se détendre, bronzer et se ressourcer dans un cadre calme et enchanteur. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5e0f8059-450f-4a1a-9c13-2460242c5ec8", "translation" => "شاطئ نموذجي في المنطقة، إنه المكان المثالي للاسترخاء واحتساء أشعة الشمس واستعادة النشاط في إطار هادئ وساحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //145
            ["id" => "b1c89c1e-3c0b-4e4e-9b95-31c75126ef70", "translation" => "Located in the heart of the city, the museum houses an impressive collection of objects, photographs, and documents related to the struggle for Algeria's independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d910205c-526e-4252-8003-ae497dd1f279", "translation" => "Situé au cœur de la ville, le musée abrite une collection impressionnante d'objets, de photographies et de documents relatifs à la lutte pour l'indépendance de l'Algérie. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2e4ece87-b8b0-415a-ba3c-66d0282d428e", "translation" => "موقع المتحف في قلب المدينة، ويضم مجموعة مذهلة من الأشياء والصور والوثائق المتعلقة بنضال الجزائر من أجل الاستقلال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //146
            ["id" => "c2938a80-8be7-4bd0-9de0-7faf7f7aff2d", "translation" => "Sidi Belloua is buried in a mausoleum at the top of the village of Redjaouna. The place attracts many visitors who come out of curiosity or on pilgrimage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6075455b-91d3-4ab5-9ff5-e11ae4f3deac", "translation" => "Sidi Belloua est inhumé dans un mausolée au sommet du village de Redjaouna. L’endroit attire beaucoup de visiteurs qui y viennent par curiosité ou en pèlerinage. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "398db38a-c30c-4f8c-95b0-1c1f2a5e35af", "translation" => "سيدي بلوى مدفون في ضريح يقع على قمة قرية رجاونة. هذا المكان يجذب العديد من الزوار الذين يأتون إلى هنا من أجل الفضول.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //147
            ["id" => "625e8c23-d990-4479-b275-6073c2258cd6", "translation" => "This structure, with its original architecture, is an authentic showcase of the cultural heritage of the province and presents traditional craftsmanship in all its richness and diversity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3b86eeac-1645-47d4-8f61-fbca7ae18ea6", "translation" => "Cette structure, d’une architecture originale, est une authentique vitrine du patrimoine culturel de la wilaya et présente l’artisanat traditionnel dans toute sa richesse et sa diversité. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c13e55ec-55d0-40f1-80f6-176b5b3e6e69", "translation" => "هذا المبنى بتصميمه الأصلي، هو عرض حقيقي للتراث الثقافي للمحافظة وتقديم حرف الصناعة التقليدية بكل غناها وتنوعها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //148
            ["id" => "053c4839-4c65-4a89-9fc4-dd80c810a0c9", "translation" => "The preferred place for cinema enthusiasts and a dynamic cultural space in the heart of Bejaïa.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b026970c-a37b-47c2-896d-d572c0489298", "translation" => "Le lieu de prédilection pour les passionnés de cinéma et un espace culturel dynamique au cœur de Béjaïa. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1fe46734-8cd4-4c94-af76-8f84b6a9d094", "translation" => "المكان المفضل لعشاق السينما ومساحة ثقافية ديناميكية في قلب بجاية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //149
            ["id" => "42aa2191-e140-4469-8c4f-16b855dbc57a", "translation" => "Gueydon square is an iconic space in the heart of the city. It is surrounded by historical buildings and filled with a vibrant atmosphere. The cafes and restaurants lining the square offer welcoming terraces where you can relax and enjoy the lively ambiance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b123fe65-49f5-4846-b658-fcd903b25bc2", "translation" => "La place Gueydon est un espace emblématique au cœur de la ville. Elle est entourée de bâtiments historiques et animée par une atmosphère vibrante. Les cafés et les restaurants bordant la place proposent des terrasses accueillantes où l'on peut se détendre et profiter de l'animation ambiante. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fe6040ab-8c69-4c51-9e53-9938ac6fa1ce", "translation" => "ساحة قيدون هي مساحة رمزية في قلب المدينة. إنها محاطة بمبان تاريخية ومليئة بأجواء نابضة بالحياة. المقاهي والمطاعم المحيطة بالساحة تقدم تراسات مرحبة حيث يمكنك الاسترخاء والاستمتاع بالأجواء الحية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //150
            ["id" => "d441a796-0650-4a82-9ef9-ac94a14deb32", "translation" => "The Tizi Ouzou cinematheque is a meeting place and exchange hub for cinema enthusiasts, contributing to the promotion of cinematic culture in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ad915ed3-c7ea-4fcb-b21e-a696d6f2adc4", "translation" => "La cinémathèque de Tizi Ouzou est un lieu de rencontre et d'échange pour les amateurs de cinéma, contribuant à la promotion de la culture cinématographique dans la région. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7416a370-dd03-46df-a280-7c3aff145c1c", "translation" => "سينماتيك تيزي وزو هي مكان للقاء والتبادل بين عشاق السينما، وتسهم في تعزيز الثقافة السينمائية في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //151
            ["id" => "bf129417-7eb6-4b57-9e5b-c68edcbf3d57", "translation" => "The maccabees cave is named as such because it houses a mummy in one of its galleries. The corpse has been naturally preserved for several centuries.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "119e8181-3bc6-4350-8d5d-4a3d6bd499b0", "translation" => "La grotte du Macchabée porte ce nom, car elle abrite une momie dans une de ses galeries. Le cadavre est conservé à l'état naturel pendant plusieurs siècles ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7d016ee8-16f9-41cf-802a-ba2d71b7b083", "translation" => "مغارة مكابي تحمل هذا الاسم لأنه تحتوي على جثة محنطة. يتم الاحتفاظ بالجثة بحالتها الطبيعية لعدة قرون.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //152
            ["id" => "f7ce2cc8-3ce9-4e53-9f73-4cc80a6233f3", "translation" => "The Yakouren forest is a true natural gem that spans a vast area, offering a lush and pristine landscape. It is characterized by abundant vegetation, with majestic trees that create a peaceful and refreshing ambiance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b3273618-83c6-4f2b-8308-50ac5c988db4", "translation" => "La forêt de Yakouren est un véritable joyau naturel qui s'étend sur une vaste superficie, offrant un paysage verdoyant et préservé. Elle est caractérisée par une végétation luxuriante, avec des arbres majestueux qui créent une ambiance paisible et rafraîchissante ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "42ad14b6-b514-45b8-9b93-ebe0a936afd1", "translation" => "غابة إعكوران هي جوهرة طبيعية حقيقية تمتد على مساحة واسعة، تقدم مناظر خضراء وطبيعة محفوظة. تتميز بنباتات غزيرة، مع أشجار مهيمنة تخلق أجواءً هادئة ومنعشة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //153
            ["id" => "98e234e3-32d9-4543-90a1-4c507ff800cd", "translation" => "Also known as paved alleys or giant tombs, these prehistoric monuments, partially concealed by vegetation, are collective tombs.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "971a6832-c25a-408b-b65b-ff585d7c4ad2", "translation" => "Appelés aussi allées dallées ou encore tombes géantes, ces monuments préhistoriques qu’on découvre partiellement dissimulés par la végétation sont des tombes collectives. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "69dbde7a-12db-48d4-abe7-6d19c4c62cdd", "translation" => "معروفة أيضًا باسم الأزقة الممهدة أو القبور العملاقة، هذه الآثار القديمة التي يتم اكتشافها جزئيا والتي تختبئ جزئيا بواسطة النباتات، هي مقابر جماعية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //154
            ["id" => "3a599351-1034-449b-b704-413a7a44a594", "translation" => "The Agoulmime lake is a true natural treasure. Nestled at an altitude of 1673 meters in the Djurdjura national park, this enchanting lake offers a breathtaking landscape. The surroundings of the lake provide a rich biodiversity, with diverse flora and fauna to discover.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b58f5652-744c-47c1-b8cd-a156e252576c", "translation" => "Le lac Agoulmime est un véritable trésor naturel. Niché à 1673 mètres d’altitude dans le parc national du Djurdjura, ce lac enchanteur offre un paysage à couper le souffle. Les alentours du lac offrent une biodiversité riche, avec une flore et une faune variées à découvrir. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "570fe3db-f9c0-4f68-8624-fb2eb4b20590", "translation" => "بحيرة أغولميم هي كنز طبيعي حقيقي. متواجدة على ارتفاع يبلغ 1673 مترًا في الحظيرة الوطنية جرجرة، تقدم هذه البحيرة الساحرة مناظر طبيعية تأسر الألباب. المحيطات بالبحيرة توفر تنوعًا حيويًا غنيًا، مع تنوع النباتات والحيوانات لاكتشافه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //155
            ["id" => "738066e2-df78-4a7a-b8b9-e833fc8e66fe", "translation" => "The panoramic views of the sea add a touch of natural beauty to this historic site. It's a captivating place for history enthusiasts and archaeology buffs.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2faba27f-4137-4f43-a431-c74813e08580", "translation" => "Les vues panoramiques sur la mer ajoutent une touche de beauté naturelle à ce site historique. C'est un lieu fascinant pour les amateurs d'histoire et les passionnés d'archéologie. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dad91575-9c56-42a5-b913-4cd127a0c2f8", "translation" => "المناظر البانورامية للبحر تضيف لمسة من الجمال الطبيعي إلى هذا الموقع التاريخي. إنه مكان رائع لعشاق التاريخ وعشاق علم الآثار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //156
            ["id" => "58e81a9a-5fbd-47fd-b9bd-96def5ad8c5a", "translation" => "Located in the heart of the Djurdjura national park, the tourist site of Tala Guilef welcomes numerous nature enthusiasts, hikers, and skiers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f694eb3e-33c0-4aa0-bda0-763f911d24ca", "translation" => "Étant située au cœur du parc national du Djurdjura, le site touristique de Tala Guilef accueille de nombreux amateurs de nature, de randonnées et de ski. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0cdb4edf-c316-4ddf-96fc-e94df487c817", "translation" => "بوجودها في قلب الحظيرة الوطنية لجرجرة، يستقبل موقع تالا قيلف السياح الذين يحبون الطبيعة ومحبي رياضة المشي لمسافات طويلة ورياضة التزلج.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //157
            ["id" => "f2a211ae-7fa6-4bac-b558-07d60ffd964b", "translation" => "An ancient Roman city featuring thermal baths, cisterns, the northern city gate, traces of watchtowers, and evidence of a necropolis.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c36fdb7c-5c2c-4f88-972c-0d07e89225f7", "translation" => "Ville antique romaine comportant des thermes, des citernes, porte nord de la ville, traces de tours de surveillance ainsi que des traces de nécropole. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3c95b499-b7a6-4f13-8d43-606adbaf5b41", "translation" => "مدينة رومانية قديمة تضم حمامات وصهاريج وبوابة المدينة الشمالية وآثار أبراج مراقبة بالإضافة إلى آثار مقبرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //158
            ["id" => "6a3f5ec9-fe7c-4453-876c-0508864203db", "translation" => "The Mouloud Mammeri house of culture is a true center for the promotion of culture and art, providing a space for artists and the public to meet and exchange ideas.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3b5c0e77-3064-4497-87dc-f83d966235ac", "translation" => "La maison de la culture Mouloud Mammeri est un véritable centre de promotion de la culture et de l'art, offrant un espace de rencontre et d'échange pour les artistes et le public. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "51b3136e-6641-48cf-b79a-190311be1569", "translation" => "دار الثقافة مولود معمري هو مركز حقيقي لتعزيز الثقافة والفن، ويوفر مساحة للفنانين والجمهور للالتقاء وتبادل الأفكار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //159
            ["id" => "f8dfedaf-ceeb-40af-9520-735ad9d17871", "translation" => "The Djurdjura cinema provides film enthusiasts with a friendly space to discover and appreciate the seventh art.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "febe249d-78a5-4a65-8c5b-b675595cd780", "translation" => "Le cinéma Djurdjura offre aux cinéphiles un espace convivial pour découvrir et apprécier le septième art. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e116421a-09f7-48e8-9284-f31dc4525f5e", "translation" => "سينما جرجرة تقدم لعشاق السينما مكانًا وديًا لاكتشاف وتقدير الفن السابع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //160
            ["id" => "64a4afbd-3d37-4e27-b653-374e7307060f", "translation" => "The November 1, 1954 Square is a popular meeting and relaxation spot for residents and visitors, providing a panoramic view of the city and a lively atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "45bb575a-6fc6-4770-ae89-a92aa94c58a9", "translation" => "Le Square 1er Novembre 1954 est un lieu de rencontre et de détente apprécié des habitants et des visiteurs, offrant une vue panoramique sur la ville et une atmosphère animée. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0af88438-f083-407f-a19a-e3892d60ec3c", "translation" => "ساحة أول نوفمبر 1954 هي مكان للاجتماع والاسترخاء محبب لدى السكان والزوار، حيث توفر إطلالة بانورامية على المدينة وأجواء حية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //161
            ["id" => "9aa32f28-cf6a-496c-a943-8613337f5547", "translation" => "An ancient archaeological site of great significance containing lybic inscriptions dating back centuries before our era.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "21097890-b43d-40d7-9ba8-c21858992e98", "translation" => "Site archéologique antique d’une grande importance contenant des écritures libyques qui remonte à des siècles avant notre ère. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6c2e3855-9cff-4c5b-b327-797bc9bbc10f", "translation" => "موقع أثري قديم ذو أهمية كبيرة يحتوي على كتابات ليبية تعود إلى قرون قبل عصرنا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //162
            ["id" => "44ef8c2a-bc56-45b9-9ad5-8ecda6191b66", "translation" => "A historical military structure from the Turkish era, the construction of this fort dates back to the early 18th century.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d374b0f1-fd56-4b06-b2fc-e0855e717903", "translation" => "Vestige historique à caractère militaire de l’époque turque, l’édification de ce fort remonte au début du 18e siècle. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "24422de4-eab1-4c57-94c4-d45fbcbd4aa5", "translation" => "هيكل عسكري تاريخي من عهد الدولة العثمانية، بُني هذا القلعة في بداية القرن الثامن عشر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //163
            ["id" => "fe7520e6-fb45-42fa-a880-f16593868129", "translation" => "A museum dedicated to the memory of Abane Ramdane, one of the key figures in the Algerian revolution. It houses a collection of objects, documents, and photographs depicting the life and journey of this political and revolutionary figure.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9c67af59-2d23-4c6d-a07f-31a3bac169aa", "translation" => "Musée dédié à la mémoire d'Abane Ramdane, un des principaux artisans de la révolution algérienne. Il abrite une collection d'objets, de documents et de photographies relatant la vie et le parcours de cet homme politique et révolutionnaire. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "341d9f01-2148-452e-abb2-2ae88faee743", "translation" => "متحف مكرس لذكرى عبان رمضان, أحد رواد الثورة الجزائرية. يحتوي على مجموعة من الأشياء والوثائق والصور تعكس حياة ومسار هذا السياسي الثائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //164
            ["id" => "12557731-7b9c-4c77-a99b-345ba73b4685", "translation" => "The Bengut lighthouse is an iconic landmark of the city of Dellys, adding to its charm and appeal for visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "656fbe0b-617f-4ef4-9514-8ccb7d799cb3", "translation" => "Le phare Bengut est un point de repère emblématique de la ville de Dellys, ajoutant à son charme et à son attrait pour les visiteurs. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "63d75947-8015-426c-9e02-5b4d8e288155", "translation" => "منارة رأس بن غوت هي علامة معروفة في مدينة دلّيس، ما يزيد من جاذبيتها وجمالها للزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //165
            ["id" => "4f8749b8-3f86-4efe-8117-991d5f71f666", "translation" => "The Kasbah of Dellys is one of the oldest and most significant historical monuments in Algeria. Its construction dates back to the Hammadid period in 1068 by Moez al-Dawla Ibn Samadh, who, after the destruction of the Hammadid emirate near Msila, fled to the city of Bejaia and from there to the city of Dellys.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "518ce83c-5773-4cba-9956-1e787562be03", "translation" => "La casbah de Dellys est l'un des monuments historiques les plus anciens et les plus importants d'Algérie. Sa construction remonte à la période Hammadide en 1068 par Moez al-Dawla Ibn Samadh qui, après la destruction de l’émirat des Hammadides près de Msila, s’enfuira vers la ville de Bejaia et de là vers la ville de Dellys. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "017acc89-2dc3-4faf-a96d-cb69e01f2975", "translation" => "قصبة دلس واحد من أقدم وأهم المعالم التاريخية في الجزائر. تعود بناؤه إلى الفترة الحمادية في عام 1068 على يد معاذ الدولة ابن صمد، الذي فر إلى مدينة بجاية ومنها إلى مدينة دليس بعد تدمير إمارة الحماديين بالقرب من مسيلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //166
            ["id" => "8ade4bd0-a9ca-41df-a782-51cc0337bec0", "translation" => "Many artisans exhibit their works in various fields including basket weaving, traditional clothing manufacturing, jewelry, and ceramics. The center also offers training workshops for young people interested in acquiring the basics of craftsmanship and skills in various artisanal industries.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d350682d-2c0d-4543-8029-2eb74c580c68", "translation" => "De nombreux artisans y exposent leurs œuvres dans divers domaines de la confection de paniers, la fabrication de vêtements traditionnels, de bijoux et de la céramique. Le centre organise également des stages de formation au profit des jeunes qui souhaitent acquérir les rudiments de l'artisanat et des compétences dans diverses industries artisanales. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f32ddc0d-60db-4212-8197-171b9a5d90d8", "translation" => "يعرض العديد من الحرفيين أعمالهم في مجموعة متنوعة من المجالات بما في ذلك صناعة السلال، وتصنيع الملابس التقليدية، والمجوهرات، والخزف. ينظم المركز أيضًا ورش عمل تدريبية للشبان الراغبين في اكتساب أساسيات الحرف والمهارات في مختلف صناعات الحرف اليدوية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //167
            ["id" => "aefbaab1-dff9-476b-bc0c-5d366f6efa2b", "translation" => "A historical testament to the cultural richness of the city of Dellys. The peaceful and spiritual atmosphere of the mausoleum also makes it a conducive place for reflection and meditation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ad68f3af-95e5-439c-93e3-4f6ed393db09", "translation" => "Témoin historique de la richesse culturelle de la ville de Dellys. L'atmosphère paisible et spirituelle du mausolée en fait également un endroit propice à la réflexion et à la méditation. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bde7e1b2-7982-4b39-936f-4a936607b054", "translation" => "شاهد تاريخي على ثراء الثقافة في مدينة دليس. الجو الهادئ والروحاني في المزار يجعله أيضًا مكانًا مناسبًا للتأمل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //168
            ["id" => "01ea766b-6335-464f-a4f9-f00209d8b1cc", "translation" => "The rugged cliffs surrounding provide spectacular viewpoints of the sea and the surrounding coastline. It's an ideal place for nature enthusiasts and those seeking preserved coastal landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1e18656a-a9f6-4480-b132-bbdc8398f5de", "translation" => "Les rochers escarpés environnants offrent des points de vue spectaculaires sur la mer et la côte environnante. C'est un endroit idéal pour les amateurs de nature et de paysages maritimes préservés. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4ed4c330-7def-419a-ad33-821e2b8bf931", "translation" => "الصخور الوعرة المحيطة توفر مناظر خلابة للبحر والساحل المحيط. إنه مكان مثالي لعشاق الطبيعة والمناظر الساحلية المحفوظة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //169
            ["id" => "6ab27e4e-4ad6-4e25-8563-68e04a981c9c", "translation" => "The Ifri nteriel cave is surrounded by majestic trees and dense vegetation. Its entrance is concealed by a rocky wall where a stream meanders, adding a touch of freshness and creating a peaceful atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d3d8f5e4-7616-46c7-9024-f84516d9bec7", "translation" => "La grotte d’Ifri nteriel est entourée d'arbres majestueux et d'une végétation dense. Son entrée est dissimulée par une paroi rocheuse où serpente un ruisseau ajoutant une touche de fraîcheur et créant une ambiance paisible. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8e48a171-a7d8-40b9-9e61-ac6130237da7", "translation" => "مغارة ايفري نتريل محاط بأشجار مهيبة ونباتات كثيفة. مدخله مخفي خلف حائط صخري يتداول فيه جدول مائي، مما يضيف لمسة من الانتعاش ويخلق أجواء هادئة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //170
            ["id" => "44cd9ad7-13a2-428a-a959-0040889b4018", "translation" => "It's the perfect place to recharge, read a book, or simply observe the world passing by slowly. Benches invite passersby to take a break amidst trees and decorative plants that adorn the edges of the square.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "407bfa0d-cf3f-4ac3-86bd-bd300f59a7c5", "translation" => "C'est l'endroit idéal pour se ressourcer, lire un livre ou simplement observer le monde qui passe doucement. Des bancs invitent les passants à faire une pause au milieu d’arbres et de plantes décoratives qui ornent les abords de la placette. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "aca84f85-0dee-49d7-8a88-5628e5168fe8", "translation" => "إنه المكان المثالي للاسترخاء، قراءة كتاب، أو مجرد مراقبة العالم الذي يمر ببطء. المقاعد تدعو المارة لأخذ استراحة وسط الأشجار والنباتات الزينة التي تزين حواف الساحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //171
            ["id" => "f1e5e8be-0641-49a4-af89-c981f305c147", "translation" => "The craft house is a meeting place between artisans and visitors, where one can admire their craftsmanship, purchase unique pieces, and learn more about the traditional crafts of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "655a4669-52b5-415a-9f97-daf02c9d40a4", "translation" => "La maison de l'artisanat est un lieu de rencontre entre les artisans et les visiteurs, où l'on peut admirer leur savoir-faire, acheter des pièces uniques et en apprendre davantage sur les traditions artisanales de la région. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e5038404-52a5-4048-9f55-026ef58030ec", "translation" => "دار الصناعة التقليدية مكان للتلاقي بين الحرفيين والزوار، حيث يمكن للزوار أن يعجبوا بمهارتهم، ويشتروا قطعًا فريدة، ويتعلموا المزيد عن التقاليد الحرفية التقليدية في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //172
            ["id" => "0a241380-8880-4da8-9502-0d56ea433a85", "translation" => "Although the hippodrome has sadly been abandoned for far too long, it still attracts curious travelers eager to explore this iconic place in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ef5b2a24-8af2-4cb6-8a6b-0090624304b8", "translation" => "Bien que l’hippodrome soit laissé malheureusement à l’abandon depuis bien trop longtemps, il continue d’attirer les voyageurs curieux de découvrir ce lieu incontournable de la région. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ee0ed978-0a01-46c0-a4fd-b68ae2369cb2", "translation" => "على الرغم من أن الحلبة تركت بأسف لفترة طويلة جدًا، إلا أنها لا تزال تجذب المسافرين الفضوليين الذين يتطلعون لاستكشاف هذا المكان البارز في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //173
            ["id" => "68839754-83ea-4f72-8369-4688599f89ea", "translation" => "The gorges of Ammal offer a spectacular and majestic landscape. The imposing rock formations create vertical walls and narrow passages, giving the impression of entering a true canyon. In the heart of the gorges, one can admire stunning waterfalls and natural pools of striking beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0da7d366-4a34-46f6-a866-c03a2c7e5c6b", "translation" => "Les gorges de Ammal offrent un paysage spectaculaire et grandiose. Les formations rocheuses imposantes créent des parois verticales et des défilés étroits, donnant l'impression d'entrer dans un véritable canyon. Au cœur des gorges, on peut admirer des cascades et des piscines naturelles d'une beauté saisissante. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2120466c-2039-4a31-ae32-29e31b23fce9", "translation" => "مضائق عمال تقدم مناظر طبيعية مذهلة ورائعة. تشكل التكوينات الصخرية الضخمة جدرانًا رأسية وممرات ضيقة، مما يعطي انطباعًا بأنك تدخل فعليًا إلى كانيون حقيقي. في قلب المضائق، يمكن للزائرين أن يعجبوا بشلالات رائعة وبرك طبيعية ذات جمال مذهل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //174
            ["id" => "2db13664-9c7d-4811-9fe5-1f221c055bc1", "translation" => "This impressive dam spans a vast expanse of water surrounded by picturesque mountains and plains, offering a breathtaking landscape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9694f00c-1ad7-48f4-aa6d-6c8e19d566a5", "translation" => "Ce barrage impressionnant s'étend sur une vaste étendue d'eau entourée de montagnes et de plaines pittoresques, offrant un paysage à couper le souffle. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1e181df3-24c0-4b38-ad64-09acaa9a3b6c", "translation" => "هذا السد يمتد عبر مساحة واسعة من المياه محاطة بجبال وسهول مما يقدم مناظر طبيعية خلابة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //175
            ["id" => "f4e541e4-bd89-4d23-b946-93d660a5714b", "translation" => "The botanical garden is a true haven of peace in the heart of the city. Created in the 19th century, this botanical garden is home to an impressive variety of plants and trees, offering a real spectacle of colors and scents. Visitors can stroll through shaded pathways, admire the blooming flowers, and relax on the lush lawns. Water pools, fountains, and benches invite contemplation and relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "680a3d7a-6838-44f7-9790-4eba7cfa0375", "translation" => "Le jardin d’essai est un véritable havre de paix au cœur de la ville. Ce jardin botanique, créé au XIXe siècle, abrite une variété impressionnante de plantes et d'arbres, offrant ainsi un véritable spectacle de couleurs et de senteurs. Les visiteurs peuvent se promener à travers les allées ombragées, admirer les fleurs en fleur et se détendre sur les pelouses verdoyantes. Des bassins d'eau, des fontaines et des bancs invitent à la contemplation et à la relaxation. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "20675375-ffe7-4278-a710-a6c0fdc53941", "translation" => "حديقة التجارب هي ملاذ حقيقي للسلام في قلب المدينة. تأسس هذا الحديقة النباتية في القرن التاسع عشر وهي موطن لتنوع مذهل من النباتات والأشجار، مما يقدم عرضًا حقيقيًا من الألوان والروائح. يمكن للزوار التجول عبر الممرات المظللة، والتمتع بزهور، والاسترخاء على العشب الخضراء. الأحواض المائية والنافورات والمقاعد تدعو إلى التأمل والاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //176
            ["id" => "f9af1789-1fec-469d-bb52-b6bda8d4af8c", "translation" => "The Ketchaoua mosque is an architecturally rich jewel with a deep history. It was built in the 17th century and is considered one of the city's most significant mosques. Its architectural style blends Ottoman, Arab, and Andalusian influences, creating a unique atmosphere..", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7938bc01-0dc4-4c66-9b77-1d63489daef9", "translation" => "La mosquée Ketchaoua est un joyau architectural chargé d'histoire. Elle a été construite au XVIIe siècle et est considérée comme l'une des plus importantes mosquées de la ville. Son style architectural mélange les influences ottomanes, arabes et andalouses, créant ainsi une atmosphère unique. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "618f92aa-0946-4eab-a087-704cdc5e6a96", "translation" => "مسجد كتشاوة هو جوهرة معمارية غنية بالتاريخ. تم بناؤه في القرن السابع عشر ويُعتبر واحدًا من أهم المساجد في المدينة. تمزج أسلوبه المعماري بين التأثيرات العثمانية والعربية والأندلسية، مما يخلق أجواء فريدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //177
            ["id" => "d3a85195-7552-4e2b-936c-0a53ada80699", "translation" => "The mosque features an impressive minaret and a central dome adorned with geometric patterns. Inside, visitors can explore a spacious prayer hall capable of accommodating thousands of worshippers, as well as study areas, libraries, and conference rooms.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "642f0438-fba9-4d97-ab2d-dfdf85de2bc7", "translation" => "La mosquée dispose d'un minaret impressionnant ainsi que d'un dôme central orné de motifs géométriques. À l'intérieur, les visiteurs peuvent découvrir une vaste salle de prière pouvant accueillir des milliers de fidèles, ainsi que des espaces d'étude, des bibliothèques et des salles de conférence. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2c279e9b-51dd-4d0e-9b5a-f473ba29f895", "translation" => "المسجد مزين بمئذنة رائعة وقبة مركزية مزينة بأنماط هندسية. في الداخل، يمكن للزوار اكتشاف قاعة صلاة واسعة يمكنها استيعاب آلاف المصلين، بالإضافة إلى مناطق للدراسة ومكتبات وقاعات مؤتمرات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //178
            ["id" => "1b823558-590f-44bb-89a9-015c9cc0b9b0", "translation" => "The great post is an iconic building located in the heart of the Algerian capital. Built during the French colonial period, it is considered an architectural masterpiece.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "53b4ccb6-03bf-4972-9ce5-4833411cd308", "translation" => "La Grande Poste d'Alger est un bâtiment emblématique situé au cœur de la capitale algérienne. Construit à l'époque coloniale française, il est considéré comme un chef-d'œuvre architectural. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "af01d477-de0e-44bc-9119-bace3fe2cec9", "translation" => "البريد المركزي هو مبنى بارز يقع في قلب العاصمة الجزائرية. تم بناؤه خلال الفترة الاستعمارية الفرنسية، ويُعتبر تحفة معمارية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //179
            ["id" => "03d0babe-ac3f-406c-8d1d-c3ebfc62a2bc", "translation" => "The martyr's memorial has become an iconic symbol of Algeria and an important commemorative site where visitors can pay tribute to the heroes of the war of independence. It was inaugurated on July 5, 1982, by the then-president, Chadli Bendjedid.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fd34b190-2fa3-4867-9ac9-a24f9c6201d8", "translation" => "Un lieu emblématique de commémoration et de recueillement où les visiteurs peuvent rendre hommage aux héros de la guerre d'indépendance. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "32cc51de-4a92-4dbd-bfd3-cb35bd6aaf04", "translation" => "مقام الشهيد أصبح رمزًا بارزًا للجزائر وموقعًا تذكاريًا مهمًا حيث يمكن للزوار تقديم الاحترام لأبطال حرب الاستقلال. تم افتتاحه في 5 جويلية 1982 من قبل الرئيس آنذاك، شادلي بن جديد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //180
            ["id" => "cfc59a65-97a4-4f78-8dbd-facd60563b97", "translation" => "Perched on a hill overlooking the Bay of Algiers, it is an iconic symbol of the city. It is also a popular tourist destination for its architectural beauty and spiritual ambiance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "34e7bf65-22b9-41ff-a07f-4af4ee220569", "translation" => "Perchée sur une colline surplombant la baie d'Alger, elle est un symbole emblématique de la ville. Elle est également une destination touristique prisée pour sa beauté architecturale et son ambiance spirituelle. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "84d16022-0d55-4e15-ae4f-99e23526075e", "translation" => "موجودة على تلة تطل على خليج الجزائر، إنها رمز بارز للمدينة. إنها أيضًا وجهة سياحية مشهورة بجمالها المعماري وأجوائها الروحية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //181
            ["id" => "a04c4af8-1702-44f2-88f9-5307ad71cf1b", "translation" => "The Kasbah is a neighborhood the size of a city. It still preserves, to this day, despite the vicissitudes of time, the authenticity of Algerian architectural heritage..", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9901b422-db9e-4a4b-975c-e3faa58cbd05", "translation" => "La Casbah est un quartier de la taille d'une ville. Elle préserve encore et à ce jour, malgré les vicissitudes du temps, l'authenticité du patrimoine architectural algérien. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e4453eae-cfad-4a43-a9a9-3a78dbf2ef40", "translation" => "القصبة هي حي بحجم مدينة. إنها تحتفظ بالأصالة للتراث المعماري الجزائري حتى يومنا هذا، على الرغم من تقلبات الزمن.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //182
            ["id" => "d3f32087-dd25-406b-93c1-08444a7b11ed", "translation" => "Located in a historic building, it houses an extensive collection of artworks ranging from modern art to contemporary art. Visitors can admire paintings, sculptures, engravings, and applied arts created by Algerian and international artists.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "44882bf1-9403-409b-ad68-6cc9787c9d43", "translation" => "Situé dans un bâtiment historique, il abrite une vaste collection d'œuvres d'art allant de l'art moderne à l'art contemporain. Les visiteurs peuvent y admirer des peintures, des sculptures, des gravures et des arts appliqués réalisés par des artistes algériens et internationaux. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a614a522-d6f4-4ef5-a972-ab675a0439d5", "translation" => "يقع في مبنى تاريخي، ويحتوي على مجموعة واسعة من الأعمال الفنية تتراوح بين الفن الحديث والفن المعاصر. يمكن للزوار أن يعجبوا باللوحات والمنحوتات والنحت والفنون التطبيقية التي أُنتِجت من قِبَل فنانين جزائريين ودوليين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //183
            ["id" => "ec18db58-4e1d-4d55-ba52-f04564915dee", "translation" => "The Bardo museum is a leading cultural institution in the capital. It houses rich collections of objects and artworks that trace the history, culture, and traditions of Algeria.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dd8a07a9-3071-4e5d-8c6b-0a07a9cfdda3", "translation" => "Le musée national du bardo est une institution culturelle de premier plan de la capitale. Il abrite de riches collections d'objets et d'œuvres d'art qui retracent l'histoire, la culture et les traditions de l'Algérie. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "468c4f76-e826-4e2b-bd58-e4140e8f5a4c", "translation" => "المتحف الوطني باردو هو مؤسسة ثقافية رائدة في العاصمة. يضم مجموعات غنية من الأشياء والأعمال الفنية التي تتبع تاريخ وثقافة وتقاليد الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //184
            ["id" => "bafcaa05-3042-4abe-a830-cfc22c0b9296", "translation" => "The museum houses an impressive collection of modern and contemporary artworks, featuring both national and international artists. Visitors can explore paintings, sculptures, installations, and other forms of contemporary art, reflecting the latest artistic trends and expressions.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "26e0c985-65bb-4357-a725-5b81695ef4c5", "translation" => "Le musée abrite une impressionnante collection d'œuvres d'art moderne et contemporain, représentant des artistes nationaux et internationaux. Les visiteurs peuvent y découvrir des peintures, des sculptures, des installations et d'autres formes d'art contemporain, reflétant les tendances et les expressions artistiques les plus récentes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c17eb162-3ce8-4ef2-b72a-fd3322a52ab0", "translation" => "المتحف يضم مجموعة رائعة من الأعمال الفنية الحديثة والمعاصرة، تمثل فنانين وطنيين ودوليين. يمكن للزوار اكتشاف لوحات ومنحوتات وتثبيتات وأشكال فنية معاصرة أخرى، تعكس أحدث الاتجاهات والتعبيرات الفنية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //185
            ["id" => "12b97d68-0bdb-4a19-95db-663824edd32d", "translation" => "The national people's army museum is an institution that houses an extensive collection of objects, weapons, uniforms, documents, and testimonies related to different periods of the country's military history. Visitors can explore thematic exhibitions that cover periods from antiquity to the contemporary era.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f4eddeb6-4753-40b6-924f-8dbe5099ff63", "translation" => "Le musée de l’armée nationale populaire est une institution qui abrite une vaste collection d'objets, d'armes, d'uniformes, de documents et de témoignages relatifs aux différentes périodes de l'histoire militaire du pays. Les visiteurs peuvent découvrir des expositions thématiques qui couvrent des périodes allant de l'antiquité à l'époque contemporaine. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ff38ff6c-5766-4fe9-a355-7bf186ea7588", "translation" => "متحف الجيش الوطني الشعبي هو مؤسسة تحتضن مجموعة واسعة من الأشياء والأسلحة والزي العسكري والوثائق والشهادات المتعلقة بمختلف فترات التاريخ العسكري للبلاد. يمكن للزوار استكشاف معارض ذات موضوعات متنوعة تغطي الفترات من العصور القديمة إلى العصر المعاصر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //186
            ["id" => "d7228b00-3498-4957-89ee-02212ed1ce3b", "translation" => "The museum provides an overview and a comprehensive portrayal of the various civilizations that Algeria has witnessed from the dawn of history until the mid-19th century AD.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "69451a91-8853-44e1-9f84-d6dda80deab6", "translation" => "Le musée donne un aperçu et un tableau complet des différentes civilisations qu’a connu l'Algérie depuis l'aube de l'histoire jusqu'au milieu du XIXe siècle après JC. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1c125a65-a6b6-4785-b582-8c415a089adb", "translation" => "المتحف يقدم نظرة عامة وصورة شاملة للحضارات المختلفة التي شهدتها الجزائر منذ بزوغ التاريخ حتى منتصف القرن التاسع عشر الميلادي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //187
            ["id" => "7050d88d-46ca-47fa-99e9-ccefe0b62fdf", "translation" => "The palace of the raïs is one of the most significant historical monuments in Algiers. It is also one of the last witnesses of the Kasbah's expansion towards the sea during the Ottoman period until the 19th century.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d31cfbe6-39e7-4e6d-9bf4-4d4ea35cdb4b", "translation" => "Palais des Raïs est l'un des monuments historiques les plus importants d'Alger. Il est aussi l'un des derniers témoins sur l'extension de la Casbah sur à la mer durant de la période ottomane jusqu'au XIXe siècle. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "76c30c90-73f6-4819-aad6-65b9d437930e", "translation" => "قصر الرياس هو واحد من أهم المعالم التاريخية في الجزائر. إنه أيضًا واحد من آخر الشواهد على امتداد القصبة نحو البحر خلال الفترة العثمانية حتى القرن التاسع عشر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //188
            ["id" => "9095d098-c9c7-463e-80f7-47beccd78d2a", "translation" => "Built in 1791 by the Dey of Algiers, Hassan Pasha, the palace is considered a personal residence and has also been used for official audiences.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bdfcc436-4587-42ac-9839-fa7a9dbee3dd", "translation" => "Construit en 1791 par le Dey d'Alger Hassan Pacha. Le Palais est considéré comme une résidence personnelle et a également été utilisé pour les audiences officielles. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8ec272e3-eac9-4e63-9ead-0332a39d428b", "translation" => "بُني القصر في عام 1791 من قبل داي الجزائر حسن باشا. يُعتَبَرُ القصر مسكنًا شخصيًا وقد تم استخدامه أيضًا للجلسات الرسمية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //189
            ["id" => "2d46c3db-70cc-4643-aadf-951ae8334215", "translation" => "Dar Mustapha Pasha is a magnificent historical palace with exceptional architectural richness. Once renovated, it has been transformed into a museum of illumination, miniature, and calligraphy, where it sometimes hosts exhibitions and special events.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "475e1ee6-ad1b-4c69-857b-ae6e57eb8284", "translation" => "Dar Mustapha Pacha est un magnifique palais historique d’une richesse architecturale exceptionnelle. Une fois rénové, il a été transformé en musée de l'enluminure, de la miniature et de la calligraphie où il abrite parfois des expositions et des événements spéciaux. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6d30ffb0-e34c-4d9b-bf89-d4a58597f8f9", "translation" => "دار مصطفى باشا هو قصر تاريخي رائع بثراء معماري استثنائي. بعد التجديد، تم تحويله إلى متحف للزخرفة، اللوحة الصغيرة، والخط العربي حيث يستضيف أحيانًا معارض وأحداث خاصة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //190
            ["id" => "3cd2e6d6-6380-4ea3-a80b-29c0e13ffc0f", "translation" => "The martyrs' square is an iconic location situated in the heart of Algiers. It is dedicated to the martyrs of the Algerian war of Independence. The square is surrounded by significant historical and governmental buildings, making it a destination for all visitors to the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "86c57af1-f864-4897-b101-31794ad45da8", "translation" => "La place des Martyrs est un lieu emblématique situé au cœur d'Alger. Elle est dédiée aux martyrs de la guerre d'indépendance algérienne. La place est entourée de bâtiments historiques et gouvernementaux importants, ce qui en fait une destination pour tous les visiteurs de la ville. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "33ba7f24-c7bf-4c2c-af41-8636d832c582", "translation" => "ساحة الشهداء هي مكان رمزي يقع في قلب الجزائر العاصمة. وهي مكرسة لشهداء حرب الاستقلال الجزائرية. تحيط بالساحة مبانٍ تاريخية وحكومية هامة، مما يجعلها وجهة لجميع زوار المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //191
            ["id" => "f784f85b-f32f-40ec-90a9-24048f15e80e", "translation" => "The museum's mission is to showcase the rural and traditional heritage of Algeria. The works preserved in the museum are dedicated to everyday life, including clothing, jewelry, carpets, pottery, basketry, goldsmithing, ceramics, embroidery, furniture, and many other exceptional pieces of Algerian craftsmanship.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c168200f-75ca-4eae-a4fb-b72dbf894dc5", "translation" => "Le musée a pour vocation de faire découvrir le patrimoine rural et traditionnel de l'Algérie. Les œuvres conservées au musée sont celles consacrées à la vie quotidienne telles que des vêtements, des bijoux, des tapis, des poteries, vannerie, orfèvrerie, céramiques, broderies, mobilier ainsi que plusieurs autres pièces exceptionnelles de l'artisanat algérien ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6de19335-d803-49b5-958b-dbf20331c30b", "translation" => "مهمة المتحف هي استعراض التراث الريفي والتقليدي للجزائر. الأعمال المحفوظة في المتحف تتعلق بالحياة اليومية، مثل الملابس والمجوهرات والسجاد والفخار وصناعة السلال وصائغي الذهب والخزف والتطريز والأثاث، بالإضافة إلى العديد من القطع الاستثنائية الأخرى من الحرف الجزائرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //192
            ["id" => "0d0348c9-218e-4640-a7d4-b6ee27d19933", "translation" => "One of the oldest mosques in Algiers; it was likely built in the medieval period.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7badab8e-ffad-4937-a9b6-c7fdf6d74703", "translation" => "L’une des plus anciennes mosquées d’Alger ; elle fut probablement construite à l’époque médiévale. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1bb1b5df-ad66-41c6-aa14-a8ec2d294a8d", "translation" => "واحد من أقدم المساجد في الجزائر؛ ربما تم بناؤها في العصور الوسطى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //193
            ["id" => "79742978-e7e2-4ac5-8b07-8415338597fe", "translation" => "The child museum includes a collection of donations from various embassies and various works. It also hosts children's activities, including a drawing workshop and a library for reading. Both young and old are invited to visit and enjoy its children's activities (Museum, Library, drawing).", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dd5d65d4-343b-4152-b592-3f87bf635d76", "translation" => "Le musée de l’enfant comprend un ensemble de dons d'ambassades de divers pays et d'œuvres diverses et variées. Y sont organisées également, des activités pour enfants, dont un atelier de dessin, et une bibliothèque pour la lecture. petits et grands y sont invités à le visiter et à profiter de ses activités pour enfants (Musée, Bibliothèque, dessin). ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3c788fff-dd12-4d54-af8a-251a2fafae35", "translation" => "متحف الطفل يضم مجموعة من التبرعات من سفارات مختلفة وأعمال متنوعة. يتم أيضًا تنظيم أنشطة للأطفال، بما في ذلك ورشة عمل للرسم ومكتبة للقراءة. الصغار والكبار مدعوون لزيارته والاستمتاع بأنشطته للأطفال (المتحف، المكتبة، الرسم).", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //194
            ["id" => "f561864f-0da0-41c7-b222-9e3f06de4c9d", "translation" => "The Algiers opera is an important cultural and artistic venue that attracts art and music enthusiasts from the country and beyond. It is a place where one can enjoy high-level artistic performances in an elegant and prestigious setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "27cfea81-09e3-4974-b41f-fbbe08a542f2", "translation" => "L'Opéra d'Alger est un lieu culturel et artistique important, qui attire les amateurs d'art et de musique du pays et au-delà. C'est un endroit où l'on peut apprécier les performances artistiques de haut niveau dans un cadre raffiné et prestigieux. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c1320d1d-dd79-4b25-9129-8b4e26693db9", "translation" => "أوبرا الجزائر هي مكان ثقافي وفني مهم، يجذب عشاق الفن والموسيقى من البلاد وخارجها. إنه مكان يمكن فيه الاستمتاع بأداء فني عالي المستوى في إطار أنيق ومرموق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //195
            ["id" => "f13bedb3-f241-4809-82e2-b29aed8386a1", "translation" => "The Cervantes cave is named after the famous Spanish writer Miguel de Cervantes, who sought refuge there during several escape attempts during his five years of captivity in Algiers between 1575 and 1580.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2d517365-cc02-4052-b549-64d553594f91", "translation" => "La grotte de Cervantès porte le nom du célèbre écrivain espagnol Miguel de Cervantes, qui s'y est réfugié lors de plusieurs tentatives d'évasion au cours de ses cinq années de captivité à Alger entre 1575 et 1580. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e5452725-7721-4a11-af78-f9875def0293", "translation" => "مغارة سرفانتاس تحمل اسم الكاتب الإسباني الشهير ميغيل دي سرفانتاس، الذي لجأ إليها خلال محاولات هروبه المتعددة خلال خمس سنوات من اعتقاله في الجزائر بين عامي 1575 و 1580.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //196
            ["id" => "761bb778-f301-471b-b7b8-4facfc0c4400", "translation" => "The Algerian national theater is a symbol of the importance given to art and culture in the city, and it contributes to the enrichment of the Algerian artistic scene.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2dab80dc-0611-44fa-8ffe-31795bfc0072", "translation" => "Le Théâtre National d'Alger est un symbole de l'importance accordée à l'art et à la culture dans la ville, et contribue à l'enrichissement de la scène artistique algérienne. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "da10faaa-4867-4605-b747-b5f73b39caff", "translation" => "المسرح الوطني الجزائري هو رمز للأهمية الملحوظة الممنوحة للفن والثقافة في المدينة، ويسهم في إثراء الساحة الفنية الجزائرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //197
            ["id" => "17f8415d-cfb5-4fb9-bf48-8832197c86a9", "translation" => "The Ibn Khaldoun hall is a meeting place for local and international artists, providing a platform for the promotion of culture and the arts in Algeria. It contributes to the diversity and enrichment of the artistic and cultural scene in Algiers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "863e87c9-df15-41ce-b9ff-53953023c3cb", "translation" => "La salle Ibn Khaldoun est un lieu de rendez-vous pour les artistes locaux et internationaux, offrant une plateforme pour la promotion de la culture et des arts en Algérie. Elle contribue à la diversité et à l'enrichissement de la scène artistique et culturelle d'Alger. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "815ca859-be57-4b8e-b00d-c54b6760a949", "translation" => "قاعة ابن خلدون هي مكان للتجمع للفنانين المحليين والدوليين، وتوفر منصة لتعزيز الثقافة والفنون في الجزائر. إنها تساهم في تنويع وإثراء الساحة الفنية والثقافية الجزائرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //198
            ["id" => "1548b49a-e4db-4cbb-85bc-438438965b70", "translation" => "This majestic monument with its futuristic architecture resembles a large tent. Inside, the cathedral features beautiful stained glass windows, frescoes, and sculptures, bearing witness to the rich artistic and religious heritage of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1924d1e2-d2e5-4050-81f5-5e0faced439e", "translation" => "Ce monument majestueux de par son architecture futuriste représentant une sorte de grande tente. À l'intérieur, la cathédrale présente de magnifiques vitraux, des fresques et des sculptures, témoignant du riche patrimoine artistique et religieux de la région. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "03a51d8e-3e6a-4224-b524-fd4e341a3576", "translation" => "هذا النصب، بمعماره المستقبلي البارز الذي يشبه نوعًا من الخيمة الكبيرة، يحمل داخله كاتدرائية تضم نوافذ زجاجية ملونة، ولوحات جدارية ونحتًا رائعًا، وهي علامة على الإرث الفني والديني الغني في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //199
            ["id" => "2d9013e7-845c-4bf1-8be7-e881980ad646", "translation" => "The villa now houses the headquarters of the Algerian agency for cultural outreach, which regularly organizes various exhibitions and concerts there.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3702ebe4-c4f2-4423-936b-bc42699ba4b1", "translation" => "La villa abrite désormais le siège de l'Agence algérienne pour le rayonnement culturel qui y organise régulièrement des expositions variées et des concerts. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "63bdb8c2-5328-469c-ba15-91ef8912b266", "translation" => "الدار تحتضن الآن مقر الوكالة الجزائرية للإشعاع الثقافي التي تنظم هناك معارض متنوعة وحفلات موسيقية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //200
            ["id" => "b749a352-025b-49dd-a1cc-19b797a03b68", "translation" => "Overlooking the small marina, the Tamentfoust fort completes the defensive system that protected Algiers from potential sea attacks. Today, it is a significant tourist attraction and a relic that testifies to the cultural and historical richness of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d86f943b-8011-433d-8604-3dcf25db13bb", "translation" => "Dominant le petit port de plaisance, Bordj Tamentfoust complète l’ensemble défensif qui protégeait Alger des attaques éventuelles venues de la mer. Il est aujourd’hui une attraction touristique importante et un vestige qui témoigne de la richesse culturelle et historique de la région. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0075b6ff-e8b2-4c62-bcba-a94b40c720f4", "translation" => "يتسلط على المرفأ البحري الصغير، برج تامنفوست يكمل النظام الدفاعي الذي حمى الجزائر من هجمات البحر المحتملة. اليوم، إنها جاذبية سياحية مهمة وذكرى تشهد على الثراء الثقافي والتاريخي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //201
            ["id" => "4cabc8a4-5ea0-477c-9028-e236e025e51a", "translation" => "Remnants of the wall that surrounded the entire city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "799924f3-8a5f-4bba-900c-63343495779c", "translation" => "Vestiges de la muraille qui entourait la ville entièrement. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bd66a07d-e0f0-4ad6-b202-5b8a60bdf8df", "translation" => "آثار السور الذي كان يحيط بالمدينة بأكملها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //202
            ["id" => "862391c4-5d2f-4e7d-a748-84ef1495eafb", "translation" => "The gate marks the entrance to the kasbah and is an important landmark in the urban landscape of Algiers. It now attracts history enthusiasts among visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bda3ef75-423d-4844-8689-778f4bd0ace6", "translation" => "La porte marque l'entrée de la casbah et constitue un point de repère important dans le paysage urbain d'Alger. Elle attire aujourd’hui les visiteurs amoureux d’histoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "28ad363c-5f94-48c0-82dc-258e60028674", "translation" => "البوابة تمثل مدخل القصبة وتعتبر نقطة معلم هامة في المشهد الحضري لمدينة الجزائر. إنها تجذب الآن عشاق التاريخ بين الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //203
            ["id" => "4241d254-ced1-4670-8cd6-471d2e3acce6", "translation" => "The Sablettes park is a public facility for the benefit of the metropolitan area. It includes green spaces and recreational facilities to provide comfort and leisure to the citizens.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "30464782-ca05-4fb3-b4f7-70ed49686ec1", "translation" => "Le parc des sablettes est une installation publique au profit des métropolitains. Il comprend des espaces verts et des installations de loisirs afin d'offrir confort et loisirs aux citoyens. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ed061298-b52a-4fcf-a001-62ba77de6f8b", "translation" => "حديقة صابلات هي منشأة عامة في صالح السكان في المنطقة. تحتوي على مساحات خضراء ومرافق ترفيهية لتوفير الراحة للمواطنين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //204
            ["id" => "ce387a57-6663-40b9-91a8-b43f72a61044", "translation" => "The Ben Aknoun park is divided into two areas and includes a zoo and an amusement park, providing a unique combination of thrilling rides and wildlife encounters.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b2258515-b1c5-4dae-8158-e8117beece43", "translation" => "Le parc de Ben Aknoun est divisé en deux zones et comprend un zoo et un parc d'attractions. Il offre ainsi une combinaison unique d'attractions à sensations fortes et de rencontres avec la faune. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "400a4a15-940d-44b0-864f-a02f59950d99", "translation" => "حديقة بن عكنون مقسمة إلى منطقتين وتحتوي على حديقة حيوانات ومتنزه. وبالتالي، فهي تقدم مزيجًا فريدًا من الركوب المثير ولقاءات مع الحياة البرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //205
            ["id" => "81180fc9-2215-4b0b-9972-49bef2f46c9b", "translation" => "Also known as 'the Citadel,' it was built in the 16th century. It served as the residence of the last two deys of Algiers, namely Ali Khoja from 1817 to 1818 and Hussein from 1818 to 1830.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bd6f30b0-eb3c-4370-ba35-94c533f6a5f1", "translation" => "Appelé également la 'la Citadelle' a été construit au XVIe siècle. Il fut la résidence des deux derniers deys d'Alger, à savoir Ali Khoja 1817-1818 et Hussein 1818-1830. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "73ac7fc8-a88d-4e24-9fa1-58706c44726c", "translation" => "يُعرف أيضًا بـ 'القلعة' وقد بني في القرن السادس عشر. كان يُستخدم كمقر إقامة الداي الأخيرين في الجزائر، وهما علي خوجة من 1817 إلى 1818 وحسين من 1818 إلى 1830.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //206
            ["id" => "244b8274-acdf-448e-bb12-5dcad740dd4d", "translation" => "The Prague garden is a haven of peace located in the heart of the city. This landscaped garden offers a tranquil and relaxing atmosphere, perfect for unwinding and escaping the urban hustle and bustle. Shaded pathways, majestic trees, and colorful flowers create a serene and inviting ambiance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0870ddda-6de2-4092-850c-ef837fada1d8", "translation" => "Le Jardin de Prague est un havre de paix situé au cœur de la ville. Ce jardin paysager offre une atmosphère calme et relaxante, idéale pour se détendre et échapper à l'agitation urbaine. Les allées ombragées, les arbres majestueux et les fleurs colorées créent une ambiance sereine et invitante. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2a729fb8-d25d-4f75-9c86-e0ba5d6683fd", "translation" => "حديقة براغ هي ملاذ للسلام يقع في قلب المدينة. توفر هذه الحديقة المناظر الطبيعية جوًا هادئًا ومريحًا، مثاليًا للاسترخاء والابتعاد عن صخب الحياة الحضرية. الدروب المظللة والأشجار الرائعة والزهور الملونة تخلق أجواءً هادئة وجاذبة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //207
            ["id" => "6c947f51-e958-4c46-a279-7a3dbc79d8b2", "translation" => "The great mosque is not only a place of worship but also a cultural, religious, and historical symbol of the city of Algiers, attracting worshippers and visitors from around the world.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "852c325b-9e53-4442-9251-faf43a6338e3", "translation" => "La grande mosquée est non seulement un lieu de culte, mais aussi un symbole culturel, religieux et historique de la ville d'Alger, attirant les fidèles et les visiteurs du monde entier. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e74d9c7d-32b6-42bb-885e-4bc31bf4ec31", "translation" => "الجامع الكبير ليس فقط مكانًا للعبادة، بل هو أيضًا رمز ثقافي وديني وتاريخي لمدينة الجزائر، حيث يجذب المؤمنين والزوار من جميع أنحاء العالم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //208
            ["id" => "686b2768-0925-40fe-83a4-0d5ba0f397b0", "translation" => "It is a place of remembrance that perpetuates the bravery of the residents of the kasbah of Algiers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "55aa87a3-1b79-473a-868f-13f335963466", "translation" => "C’est un lieu de mémoire et de recueillement qui pérennise la bravoure des habitants de la Casbah d’Alger. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c0918289-581b-49fb-bec4-69a14b6b1a44", "translation" => "إنه مكان للذكرى والتأمل يثبت شجاعة سكان قصبة الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //209
            ["id" => "b2979245-6d7d-41cd-aff5-3c4e36d867c8", "translation" => "At the beginning of the conquest, the French transformed citadels and forts into military posts, and after 1850, they strengthened the defensive system with structures like Fort Istanbul. Its purpose was to monitor the entrance to the bay of Algiers, protect the city from sea attacks, and deter foreign intrusions. An inscription dated 1861 likely indicates the year of its construction, and it is classified among the detached military posts of Algiers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "224573c4-e27f-4cfd-a763-78f0ab034606", "translation" => "Au début de la conquête, les Français transformaient les citadelles et forts en postes militaires, et après 1850, ils ont renforcé le système défensif avec des édifices tels que le Fort Istanbul. Il avait pour objectif de surveiller l'entrée de la baie d'Alger, protéger la ville des attaques par la mer et empêcher les intrusions étrangères. Une inscription datée de 1861 indique probablement l'année de sa construction, et il est classé parmi les postes militaires détachés d'Alger. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "94c65497-b7b7-4d65-a6fe-2366288f5849", "translation" => "في بداية الفترة الاستعمارية، قام الفرنسيون بتحويل القلاع والحصون إلى مواقع عسكرية، وبعد عام 1850، قاموا بتعزيز النظام الدفاعي بإنشاء مبانٍ مثل قلعة إسطنبول. كان الهدف منها مراقبة مدخل خليج الجزائر وحماية المدينة من الهجمات البحرية وردع التدخلات الأجنبية. تحمل إحدى النقوش المؤرخة من عام 1861 ربما تاريخ إنشائها، وهي تصنف ضمن المواقع العسكرية المنفصلة عن الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //210
            ["id" => "6349c43b-4650-44a9-bd1c-be301b8869c9", "translation" => "This museum, aiming to provide a historical, ethnological, and scientific dimension, is located at the foot of the Casbah of Algiers in the majestic vaults of 'Khayr ad-Din,' built by Haji Ali Pasha in 1814.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1da69de0-6c0f-4260-8666-88e91b151cd2", "translation" => "Ce musée, qui vise à rendre une prestation de dimensions historiques, ethnologiques et scientifiques, est situé au pied de la Casbah d'Alger dans les majestueuses voûtes « Khayr ad-Din » construites par Haji Ali Pacha en 1814. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6b15b364-2e78-46cb-ba85-b9677d61f535", "translation" => "يقع هذا المتحف، الذي يهدف إلى تقديم بعد تاريخي وإثنولوجي وعلمي، عند سفح قصبة الجزائر في أقبية 'خير الدين' الرائعة التي بناها حاجي علي باشا في عام 1814.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //211
            ["id" => "c11b9af9-f23a-493a-8e5c-3468fa97504e", "translation" => "The Casif open air theater is a popular cultural venue, combining art, nature, and entertainment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f2006fcd-26de-482d-844a-bad496c79541", "translation" => "Le théâtre en plein air Casif constitue un lieu culturel prisé, alliant art, nature et divertissement. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3e9388b4-ae62-4b03-a65e-6846e689e882", "translation" => "مسرح الهواء الطلق الكازيف هو مكان ثقافي محبب، يجمع بين الفن والطبيعة والترفيه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //212
            ["id" => "1f033589-5338-46cb-884c-464f49504d1d", "translation" => "It offers a green escape away from the hustle and bustle of the city. The forest is characterized by lush vegetation, with majestic trees and a diversity of plant species.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "58c5424a-8adb-4437-935d-081c50ac5482", "translation" => "Elle offre une évasion verdoyante loin de l'agitation de la ville. La forêt est caractérisée par une végétation luxuriante, avec des arbres majestueux et une diversité d'espèces végétales.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c8d3b949-f1ac-4cde-a78e-d3c77a21f3bb", "translation" => "إنها تقدم هروبًا أخضرًا بعيدًا عن صخب المدينة. تتميز الغابة بنباتاتها الفاخرة، مع أشجار مهيبة وتنوع في النباتات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //213
            ["id" => "6f9bf555-bcf0-4603-ad90-c10f3307acc5", "translation" => "The shores of the lake provide suitable spaces for picnics and outdoor activities. Many aquatic birds also find refuge there, adding a touch of life and harmony to the environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1c24d523-1828-48e6-a753-340bf555ccbd", "translation" => "Les rives du lac offrent des espaces propices aux pique-niques et aux activités en plein air. De nombreux oiseaux aquatiques y trouvent également refuge, ajoutant une touche de vie et d'harmonie à l'environnement. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2cc4735a-9b95-4047-b3bb-b29245a870f8", "translation" => "شواطئ البحيرة توفر مساحات مناسبة للنزهات والأنشطة في الهواء الطلق. العديد من الطيور المائية تجد أيضًا مأوى هناك، مما يضيف لمسة من الحياة والانسجام للبيئة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //214
            ["id" => "80d3fe06-2a23-4648-9c6b-3e2a238bf731", "translation" => "This garden is a green and peaceful space where people come to relax and enjoy nature in the midst of urban bustle. The pathways are lined with trees and colorful flowers, creating a pleasant and soothing environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "da051ed2-60e1-464c-9843-feee6a210385", "translation" => "Ce jardin est un espace verdoyant et paisible où les gens viennent se détendre et profiter de la nature en plein cœur de l'agitation urbaine. Les allées sont bordées d'arbres et de fleurs colorées, créant un environnement agréable et apaisant. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "225472db-eb02-46ba-beed-2209e3c245c2", "translation" => "هذه الحديقة مكان أخضر وهادئ حيث يأتي الناس للاسترخاء والاستمتاع بالطبيعة في وسط الصخب الحضري. الأماكن المعبدة بالأشجار والزهور الملونة، تخلق بيئة لطيفة ومريحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //215
            ["id" => "0660f2f3-2420-4c81-872d-986549f959a4", "translation" => "The museum provides a captivating immersion into the world of the Algerian radio, recalling its significant role in the communication, culture, and entertainment of the country.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3b7d4c63-acaa-492c-af5f-932cdd65a991", "translation" => "Le musée offre une immersion captivante dans l'univers de la radio algérienne, rappelant son rôle important dans la communication, la culture et le divertissement du pays. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ca7dcb8f-6433-4fb4-81d3-47503b990321", "translation" => "المتحف يقدم غمرًا مثيرًا في عالم الإذاعة الجزائرية، مشيرًا إلى الدور المهم الذي لعبته في التواصل والثقافة والترفيه في البلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //216
            ["id" => "dee7840e-e790-4156-867c-fde1ae444da0", "translation" => "The Africa cinema is a true hub for the promotion and celebration of cinema, where one can enjoy captivating artistic and narrative works.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d28164cb-e09b-4267-bce5-0a3bd24adb4d", "translation" => "La salle de cinéma l’Afrique est un véritable lieu de promotion et de célébration du cinéma, où l'on peut apprécier des œuvres artistiques et narratives captivantes. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "78ca163e-5d68-4a27-9019-9a3651e696b3", "translation" => "قاعة سينما أفريقيا هي مركز حقيقي لتعزيز واحتفال بالسينما، حيث يمكن للزوار الاستمتاع بأعمال فنية وسردية مثيرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //217
            ["id" => "6f2a5f92-a7da-44aa-b7e4-6b35f750a60f", "translation" => "Whether you're a nature enthusiast, an aspiring photographer, or simply seeking tranquility by the water, the Blue lake is a place not to be missed during your visit to the El-Kala region. Come and explore this natural gem and create unforgettable memories at the Blue lake.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b3e48471-6734-4c2d-b07b-c609ea3c1819", "translation" => "Que vous soyez un amateur de nature, un photographe en herbe ou simplement en quête de tranquillité au bord de l'eau, le lac Bleu est un endroit à ne pas manquer lors de votre visite dans la région d'El-Kala. Venez découvrir ce joyau naturel et créez des souvenirs inoubliables au lac Bleu. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3da294a4-9072-4e64-b5f9-9cb42d79b064", "translation" => "سواء كنت عاشقًا للطبيعة، مصورًا مبتدئًا، أو ببساطة تبحث عن هدوء شاطئ المياه، تعد البحيرة الزرقاء مكانًا يجب ألا تفوته خلال زيارتك لمنطقة القالة. تعال واستكشف هذا الجوهر الطبيعي وأنشئ ذكريات لا تُنسى على شاطئ البحيرة الزرقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //218
            ["id" => "61033c01-4fa1-4080-84a0-869fbfce32c0", "translation" => "The Essalam square in Relizane is a lively central space that provides residents and visitors with a pleasant place to relax and be entertained.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "868d5eb9-2008-4d22-87b9-1287dd5cede3", "translation" => "La place Essalam à Relizane est un espace central animé offrant aux résidents et aux visiteurs un endroit agréable pour se détendre et se divertir. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ddc1fd24-1779-44ea-aee5-4e33d821e4ec", "translation" => "ساحة السلام في غليزان هي مساحة مركزية حيوية توفر للسكان والزوار مكانًا ممتعًا للاسترخاء والترفيه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //219
            ["id" => "65581d4a-e9b1-47c0-83d2-b0e349643d00", "translation" => "Whether it's a family outing, an evening with friends, or a solo movie experience, El Khayam cinema promises unforgettable moments of entertainment and cinematic discovery.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a3adc980-9ba8-4ffa-89a9-124b41343a0d", "translation" => "Que ce soit pour une sortie en famille, une soirée entre amis ou une séance en solitaire. La salle El Khayam promet des moments de divertissement et de découverte cinématographique inoubliables. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8a547c78-da94-4a91-850b-19cf64861c51", "translation" => "سواء كان ذلك لقضاء وقت مع العائلة، أو لقضاء أمسية مع الأصدقاء، أو حتى لجلسة سينمائية منفردة، تعد قاعة الخيام وعداً على لحظات ترفيه واكتشاف سينمائي لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //220
            ["id" => "8d262c9d-19e0-4ca5-8a09-15fe46f8f919", "translation" => "Whether you're a fan of action movies, comedies, dramas, or art-house films, the Algeria cinema is sure to satisfy even the most discerning cinephiles.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "431c830c-b405-4529-a44b-9d41ee884943", "translation" => "Que ce soit pour les amateurs de films d'action, de comédies, de drames ou de films d'art et d'essai, le cinéma l'Algeria saura satisfaire les cinéphiles les plus exigeants. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e687b540-f581-49c4-b772-5c18d0e7b1aa", "translation" => "سواء كنت من محبي أفلام الكوميديا، الدراما، أو أفلام الفن والتجريب، سيكون سينما الجزائرية هو مكان مناسب لإرضاء حتى أكثر عشاق السينما تطلبًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //221
            ["id" => "18501e7a-c04e-4220-95fc-009b70b826c3", "translation" => "Whether you're a dedicated cinephile or just looking for an entertaining night out, the Atlas cinema is an ideal place to enjoy a great show in a comfortable and pleasant setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5f3073b7-e631-478a-aae9-0f530b4e5376", "translation" => "Que vous soyez un cinéphile passionné ou simplement à la recherche d'une soirée divertissante, la salle Atlas est un endroit idéal pour profiter d'un bon spectacle dans un cadre confortable et agréable. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1833bf21-4e62-4057-8b3f-5e93155aaa1d", "translation" => "سواء كنت من محبي السينما المتحمسين أم مجرد من يبحثون عن ليلة ممتعة، فإن قاعة الاطلس هي المكان المثالي للاستمتاع بعرض رائع في إطار مريح وممتع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //222
            ["id" => "2c532e8a-0cec-400d-a67b-d81d5f151e31", "translation" => "In addition to being a screening venue, the Algerian cinematheque also hosts special events such as conferences, workshops, and film festivals. It serves as a space for cinephiles, filmmakers, and industry professionals to meet and exchange ideas.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "daf041c0-2a57-4359-9e6a-b8d6710b5ca6", "translation" => "En plus d'être un lieu de projection, la Cinémathèque algérienne organise également des événements spéciaux, tels que des conférences, des ateliers et des festivals de cinéma. C'est un espace de rencontre et d'échange pour les amateurs de cinéma, les cinéastes et les professionnels de l'industrie. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "18142a00-9db8-4187-92b8-ed357feed0be", "translation" => "بالإضافة إلى كونه مكانًا لعرض الأفلام، تنظم سينماتيك الجزائر أيضًا أحداث خاصة مثل المؤتمرات وورش العمل ومهرجانات السينما. إنها مساحة للقائمين بالسينما، وصانعي الأفلام، والمحترفين في هذه الصناعة للالتقاء وتبادل الأفكار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //223
            ["id" => "cf302ad7-a453-4a2b-b367-c15869be4b0e", "translation" => "Whether attending a captivating theater performance or being enchanted by a mesmerizing concert, the theater of central Algiers provides a rich and stimulating cultural experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1b3ec7bd-6631-493d-979d-6f3dcef5a7b5", "translation" => "Que ce soit pour assister à une représentation théâtrale captivante, se laisser emporter par un concert envoûtant, le théâtre d'Alger offre une expérience culturelle riche et stimulante. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cde95d99-5104-4354-b71a-621af84bbb06", "translation" => "سواء كنت تحضر أداءً مسرحيًا جذابًا أم تترك نفسك تتأمل في حفل موسيقي ساحر، يقدم مسرح الجزائر الوسطى تجربة ثقافية غنية ومثيرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //224
            ["id" => "9857002d-ab4e-4f67-82aa-e0a6b409ab1d", "translation" => "The Algiers Open air theatre hosts a diverse program throughout the year, featuring classical plays, traditional and contemporary music concerts, folk dance performances, outdoor film screenings, and many other cultural events.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7cfb1568-cebc-46dd-b2d3-b36ae59322da", "translation" => "Le théâtre de verdure d'Alger accueille une programmation variée tout au long de l'année, mettant en avant des pièces de théâtre classiques, des concerts de musique traditionnelle et contemporaine, des spectacles de danse folklorique, des projections de films en plein air et bien d'autres événements culturels. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "af36e56b-ad21-4593-ae2a-d8d7048d889c", "translation" => "مسرح الهواء الطلق في الجزائر يستضيف برنامجًا متنوعًا طوال العام، يضم مسرحيات كلاسيكية وحفلات موسيقى تقليدية ومعاصرة، وعروض رقص تقليدية، وعروض أفلام في الهواء الطلق، والعديد من الأحداث الثقافية الأخرى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //225
            ["id" => "ddb4058c-1fd4-4f59-8abf-3a83b7244d82", "translation" => "Benches are scattered throughout the park, providing visitors with pleasant spots to rest, read a book, or simply admire the beauty of the surroundings. Families can also take advantage of the children's playgrounds, where the little ones can safely have fun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b043a030-2eaf-4019-ba1a-dfacb70d0af6", "translation" => "Des bancs sont répartis dans tout le parc, offrant aux visiteurs des endroits agréables pour se reposer, lire un livre ou simplement contempler la beauté des environs. Les familles peuvent également profiter des aires de jeux pour enfants, où les plus jeunes peuvent se divertir en toute sécurité. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "95484065-4d7d-4e34-84ff-f0bffbdb2fec", "translation" => "المقاعد موزعة في جميع أنحاء الحديقة، مما يوفر للزوار أماكن ممتعة للراحة، قراءة كتاب، أو مجرد التمتع بجمال المحيط. يمكن للعائلات أيضًا الاستفادة من مناطق اللعب للأطفال، حيث يمكن لأصغر الأطفال التمتع بوقت ممتع بأمان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //226
            ["id" => "ad9a61a9-2a33-4b92-86d7-a4e934ed76dd", "translation" => "El Sahel cinema is a modern and welcoming venue where cinema enthusiasts can enjoy a quality cinematic experience, whether it's for entertainment, enrichment, or sharing an evening with friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "de4ee6a4-8a5f-4505-a42a-10e4fc8a72b3", "translation" => "Le cinéma el Sahel est un lieu moderne et convivial où les passionnés de cinéma peuvent profiter d'une expérience cinématographique de qualité. Que ce soit pour se divertir, se cultiver ou partager une soirée avec des amis. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "63b070b2-a646-41c8-81ed-69b1611e30f0", "translation" => "سينما الساحل مكان حديث ومرحب حيث يمكن لعشاق السينما الاستمتاع بتجربة سينمائية عالية الجودة، سواء للترفيه، أو للتثقيف، أو لقضاء أمسية مع الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //227
            ["id" => "5be39ab7-364f-43cf-ae4d-fe99b1e566d3", "translation" => "In addition to its utilitarian function, the Cap Caxine lighthouse is also a popular tourist attraction. Visitors can admire its architectural beauty, take panoramic photos from its surroundings, and enjoy the refreshing sea breeze that envelops this part of the coast.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fcb85e01-e491-48a6-9c4d-7c2512df3353", "translation" => "En plus de sa fonction utilitaire, le phare du Cap Caxine est également une attraction touristique populaire. Les visiteurs peuvent admirer sa beauté architecturale, prendre des photos panoramiques depuis ses environs et profiter de la brise marine rafraîchissante qui enveloppe cette partie de la côte. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0ff702ef-ff3e-4d0d-9037-f9533e1b61b2", "translation" => "بالإضافة إلى وظيفتها، منارة رأس كاكسين هي أيضًا معلم سياحي شهير. يمكن للزوار أن يعجبوا بجمالها المعماري، ويأخذوا صورًا بانورامية من محيطها، ويستمتعوا بنسمات البحر المنعشة التي تكسو هذا الجزء من الساحل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //228
            ["id" => "9c4b2965-1fe5-4c18-9154-df02e684654d", "translation" => "This fort, built in 1823 by Dey Hussein, is a historically significant site in Algiers. It is a place steeped in history that attracts visitors with its remarkable architecture and close connection to the region's past.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cad68a66-a77c-4ec1-8a7d-169ae46b5905", "translation" => "Ce fort, construit en 1823 par le Dey Hussein est un site historique d'une grande importance à Alger. C'est un lieu chargé d'histoire qui attire les visiteurs avec son architecture remarquable et son lien étroit avec le passé de la région. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f0e6087b-0c4f-4b0d-bdbd-d2bd71fbeeca", "translation" => "هذه القلعة، التي تم بناؤها في عام 1823 من قبل داي حسين، هي مكان ذو أهمية تاريخية كبيرة في الجزائر. إنه مكان مشحون بالتاريخ يجذب الزوار بعمارته الملحوظة وصلته الوثيقة بماضي المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //229
            ["id" => "dba19f4c-4cd6-4772-9625-ad12a1a7b4cd", "translation" => "The Moufdi Zakaria culture palace is a dynamic venue that contributes to the cultural richness and diversity of the city of Algiers. It regularly hosts cultural events such as concerts, plays, art exhibitions, and festivals, providing a platform for Algerian and international artists and creators.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ad37f258-5566-4857-b4e1-10cd22f76ecb", "translation" => "Le palais de la culture Moufdi Zakaria est un lieu dynamique qui contribue à la richesse et à la diversité culturelle de la ville d'Alger. Il accueille régulièrement des événements culturels tels que des concerts, des pièces de théâtre, des expositions d'art et des festivals, offrant ainsi une plateforme pour les artistes et les créateurs algériens et internationaux. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4e0bfc26-ddf2-4fbf-b205-c9f8cbf7bccd", "translation" => "قصر الثقافة مفدي زكرياء هو مكان ديناميكي يسهم في ثراء وتنوع الحياة الثقافية في مدينة الجزائر. يستضيف أحداثًا ثقافية مثل الحفلات الموسيقية والمسرحيات ومعارض الفن والمهرجانات، وبالتالي يقدم منصة للفنانين والمبدعين الجزائريين والعالميين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //230
            ["id" => "6c4b6205-7743-49b4-ae94-20e418eeffef", "translation" => "You will find an atmosphere filled with tranquility and contemplation, inviting visitors to immerse themselves in an artistic world rich in surprises and discoveries.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9502f4fe-ef58-4820-a466-dd055e7d3a27", "translation" => "Vous y trouverez une atmosphère empreinte de calme et de contemplation, invitant les visiteurs à plonger dans un univers artistique riche en surprises et en découvertes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f608d549-e11f-4c8a-acb8-d3a9a8045d4d", "translation" => "ستجد هنا جوًا مليئًا بالهدوء والتأمل، يدعو الزوار إلى الانغماس في عالم فني غني بالمفاجآت والاكتشافات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //231
            ["id" => "8985befe-fe89-4125-a79d-ea1df878d601", "translation" => "With its vast green spaces, exciting attractions, and playground areas, this park is an ideal meeting place for families and visitors of all ages.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2a246864-c8da-426b-8090-0c7497769077", "translation" => "Avec ses vastes espaces verts, ses attractions excitantes et ses aires de jeux, ce parc est un lieu de rendez-vous idéal pour les familles et les visiteurs de tous âges.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dbd104ac-6006-43d5-91b9-002b6524fd70", "translation" => "بفضل مساحاتها الخضراء الواسعة والمعالم المثيرة ومناطق اللعب، تعتبر هذه الحديقة مكانًا مثاليًا للاجتماع للعائلات والزوار من جميع الأعمار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //232
            ["id" => "8e2cfa60-6290-4f83-bf63-ba3061eba1c7", "translation" => "The dolmens of Ain Benian are a fascinating testament to the prehistoric past of the region. These megalithic structures, dating back thousands of years, consist of large upright stones that once formed monumental tombs.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6e9dbcda-0a56-457f-9597-9e70b36eb8e5", "translation" => "Les dolmens d'Aïn Benian, sont un témoignage fascinant du passé préhistorique de la région. Ces structures mégalithiques, datant de plusieurs milliers d'années, sont constituées de grandes pierres dressées qui formaient autrefois des tombes monumentales.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "faa7f75e-274a-44c7-9962-b093a5407837", "translation" => "دولمينات عين بنيان هي شهادة مذهلة عن الماضي القبلي للمنطقة. هذه الهياكل الميغاليتية، التي تعود إلى آلاف السنين، تتكون من حجارة كبيرة مقامة كانت في السابق مقابرًا ضخمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //233
            ["id" => "4a2b1f5d-0142-4c4a-8b89-4d747739602a", "translation" => "Whether you're an art enthusiast or just curious, the Diwaniya art gallery is a must-visit place to discover and appreciate the diversity and richness of the Algerian art scene.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "eb2fe3bc-b402-4945-aec6-40e0347e8a7b", "translation" => "Que vous soyez un passionné d'art ou simplement curieux, la galerie d'art Diwaniya est un lieu incontournable pour découvrir et apprécier la diversité et la richesse de la scène artistique algérienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cec281a7-44cd-416e-b188-5393c8230abc", "translation" => "سواء كنت عاشقًا للفن أو مجرد فضولي، فإن معرض الفنون الديوانية هو مكان لا بد من زيارته لاكتشاف وتقدير تنوع وثراء الساحة الفنية الجزائرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //234
            ["id" => "fad599df-b01b-40d9-be28-7279302339ba", "translation" => "Whether for a leisurely stroll, outdoor activities, or simply to escape the hustle and bustle of the city, the freedom park is the perfect place to rejuvenate and enjoy nature in the heart of Algiers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5569c3c9-3d00-4d2b-9cc3-a7066545723b", "translation" => "Que ce soit pour une promenade relaxante, des activités en plein air ou tout simplement pour échapper à l'agitation de la ville, le parc de la liberté est l'endroit idéal pour se ressourcer et profiter de la nature en plein cœur d'Alger.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "198c7dc2-3d96-40bd-93ec-7424d31c0309", "translation" => "سواء كنت تبحث عن نزهة مسترخية أو أنشطة خارجية أو مجرد الهروب من صخب المدينة، فإن حديقة الحرية هي المكان المثالي للاستجمام والاستمتاع بالطبيعة في قلب الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //235
            ["id" => "9b987131-2d97-4d19-adb8-c4a7710b1186", "translation" => "Remnants of the Ottoman defensive fortification system as part of controlling the Mediterranean Sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d60a9d2b-345e-4551-85a1-bde339fc29c8", "translation" => "Vestige du système défensif de fortifications Ottomane dans le cadre du contrôle de la mer méditerranéenne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d7139333-b7c1-42b7-89f1-3c39edcff59c", "translation" => "بقايا لنظام الدفاع العثماني للتحصينات كجزء من السيطرة على البحر الأبيض المتوسط.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //236
            ["id" => "c06c3472-f353-49e1-810e-3a2245fc7304", "translation" => "Whether you're a passionate art lover or simply curious to explore new forms of expression, Ezzou'Art Gallery is a place where you can get lost in creativity and be swept away by the emotions conveyed by the exhibited artworks. It's a space that celebrates imagination, originality, and the beauty of art, providing visitors with an unforgettable aesthetic experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1ec055fd-ffbb-4640-8065-859f5cc4d49e", "translation" => "Que vous soyez un amateur d'art passionné ou simplement curieux de découvrir de nouvelles formes d'expression, la galerie Ezzou’Art est un lieu où vous pouvez vous perdre dans la créativité et vous laisser emporter par les émotions qui se dégagent des œuvres exposées. C'est un espace qui célèbre l'imagination, l'originalité et la beauté de l'art, offrant aux visiteurs une expérience esthétique inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1c48e709-5464-46d3-82f3-4794eac2bdf3", "translation" => "سواء كنت من عشّاق الفن المتحمّسين أم مجرد فضولي يرغب في استكشاف أشكال تعبير جديدة، هذا المعرض للفن هو مكان حيث يمكنك الضياع في الإبداع والاستمتاع بالعواطف التي تنقلها الأعمال الفنية المعروضة. إنها مساحة تحتفل بالخيال والأصالة وجمال الفن، وتقدم للزوار تجربة جمالية لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //237
            ["id" => "b2846e38-cbe4-4280-87b1-12bf348f0520", "translation" => "Despite its small size, the gallery is filled with captivating artworks. From vibrant and expressive paintings to delicate sculptures, evocative photographs, and bold artistic installations, each piece reflects the creativity and vision of the artist.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4cf31176-c6fd-414d-9c76-9473334c9756", "translation" => "Bien que petite en taille, la galerie regorge d'œuvres d'art captivantes. Des tableaux aux couleurs vibrantes et expressives, des sculptures délicates, des photographies évocatrices ou encore des installations artistiques audacieuses, chaque pièce témoigne de la créativité et de la vision de l'artiste.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c824cc15-872e-4c4b-970e-11d436b4eaa4", "translation" => "بالرغم من صغر حجمها، إلا أن المعرض مليء بأعمال فنية مثيرة. من لوحات زاهية وعبّرة إلى منحوتات رقيقة، وصور مثيرة للتأمل، وتركيبات فنية جريئة، تعكس كل قطعة الإبداع ورؤية الفنان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //238
            ["id" => "4e286b26-404a-458e-a299-5f2ed24afb69", "translation" => "Whether it's for a refreshing stroll or a nature getaway, the Bainem forest is a haven of peace where you can rejuvenate and reconnect with the natural beauty that surrounds it.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "29221d24-004a-4087-8033-0a4b5ea0d330", "translation" => "Que ce soit pour une simple promenade revitalisante ou pour une escapade en pleine nature, la forêt de Bainem est un havre de paix où vous pouvez vous ressourcer et vous reconnecter avec la beauté naturelle qui l'entoure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4f0ddc4e-8455-4123-9136-dd2d21d56101", "translation" => "سواء كنت تبحث عن نزهة منعشة أو عن رحلة في الطبيعة، غابة بينم هي ملجأ للسلام حيث يمكنك الاسترخاء مع الجمال الطبيعي الذي يحيط بها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //239
            ["id" => "89e96264-e887-4874-a87d-76602940ac5f", "translation" => "The national public museum of Cherchell is a must-visit destination for history and archaeology enthusiasts. It provides a unique opportunity to explore and appreciate the cultural heritage of the region, highlighting the influence of the Roman civilization on these lands.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7433eb78-d0b2-4cf7-b864-570192a1b8cf", "translation" => "Le musée public national de Cherchell est un lieu incontournable pour les amateurs d'histoire et d'archéologie. Il offre une occasion unique de découvrir et d'apprécier le patrimoine culturel de la région, en mettant en lumière l'influence de la civilisation romaine sur ces terres.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9d8bfbeb-e2a8-4a66-bfcd-e15fa2985556", "translation" => "المتحف العمومي الوطني في شرشال هو وجهة لا غنى عنها لعشاق التاريخ والآثار. إنه يوفر فرصة فريدة لاستكشاف وتقدير التراث الثقافي للمنطقة، مسلطًا الضوء على تأثير الحضارة الرومانية على هذه الأراضي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //240
            ["id" => "a11df0d6-47f3-4ac6-883a-fc215afd4e16", "translation" => "While exploring the ruins, you will be fascinated by the well-preserved remnants that bear witness to the past grandeur of this city. You can admire the majestic columns, arches, and vaults that still stand proudly, despite the ravages of time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "95a0f3b3-9421-4f9d-824f-1d6e042534cb", "translation" => "En explorant les ruines, vous serez fasciné par les vestiges bien préservés qui témoignent de la grandeur passée de cette cité. Vous pourrez admirer les colonnes majestueuses, les arcs et les voûtes qui s'élèvent encore fièrement, malgré les ravages du temps.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dc4178b4-c25f-43a3-a861-9d3b8aa10114", "translation" => "بينما تستكشف الأطلال، ستكون مذهولًا بالآثار المحافظة بشكل جيد التي تشهد على عظمة هذه المدينة في الماضي. يمكنك التعجب من الأعمدة الرائعة، والأقواس، والقبوات التي تقف بفخر حتى الآن، على الرغم من تأثير الزمن.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //241
            ["id" => "3d7b8c84-83aa-49bf-a6ba-862f6e5635dd", "translation" => "Built in 1881, the Cherchell lighthouse consists of a cylindrical stone tower that stands proudly in the coastal landscape. Its white color contrasts with the deep blue of the sea and immediately catches the eye.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6cc5866a-d10d-4ae7-ae72-3a759b5ca1c8", "translation" => "Construit en 1881, le phare de Cherchell est composé d'une tour en pierre de forme cylindrique qui s'élève fièrement dans le paysage côtier. Sa couleur blanche contraste avec le bleu profond de la mer et attire immédiatement le regard.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b8cb9645-d8e1-441f-b9eb-c6f93eaac844", "translation" => "بُني في عام 1881، يتألف منار شرشال من برج حجري ذي شكل أسطواني يعتلي بفخر المناظر الساحلية. لونه الأبيض يتباين مع الأزرق العميق للبحر ويجذب الانتباه على الفور.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //242
            ["id" => "070905df-e7df-4c60-a6ae-761785c76de2", "translation" => "Whether you're a history enthusiast, an animal lover, or seeking entertainment, Numidia land promises you an unforgettable day filled with discovery, wonder, and learning.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "11d49f8b-eb7e-4045-a2e8-d1e10a1d6962", "translation" => "Que vous soyez passionné d'histoire, amateur d'animaux ou en quête de divertissement, Numidia Land vous promet une journée inoubliable mêlant découverte, émerveillement et apprentissage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8a6de49d-2734-47ef-be8e-b928db8b57f2", "translation" => "سواء كنت من عشاق التاريخ أو من محبي الحيوانات أو تبحث عن الترفيه، فإن نوميديا ​​لاند تعدك بيوم لا ينسى يجمع بين الاكتشاف والعجب والتعلم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //243
            ["id" => "7d02df2f-ae4a-4897-af9c-74f48b001216", "translation" => "A little slice of urban paradise, offering a space for relaxation and socializing in the heart of the city. It's a place where one can take a break, rejuvenate, and savor the unique atmosphere of city life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1d53ac03-37b7-452b-99b4-a1b587712151", "translation" => "Un petit coin de paradis urbain, offrant un espace de détente et de sociabilité au cœur de la ville. C'est un lieu où l'on peut prendre une pause, se ressourcer et profiter de l'atmosphère unique de la vie citadine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6872ef86-c652-4122-b00e-87b6e7371bac", "translation" => "قطعة صغيرة تقدم مساحة للاسترخاء والتواصل في قلب المدينة. أين يمكن للشخص أن يأخذ استراحة، ويجدد طاقته، و يستمتع بالجو الفريد للحياة في المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //244
            ["id" => "c2808d6b-5eae-4578-bf93-103cb6e20a19", "translation" => "Also known as the 'Mosque of a hundred columns,' this majestic building, formerly the Saint-Paul Cathedral, was constructed on Roman ruins.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6a36938f-ddfe-49f3-a9a4-a3351430c419", "translation" => "Également surnommée 'Mosquée aux cent colonnes', ce bâtiment majestueux, ex-cathédrale Saint-Paul, fut bâti sur des ruines romaines.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "87671f3e-10d2-4630-874e-9c40f921fea8", "translation" => "تُعرف أيضًا باسم 'مسجد المئة عمود'، هذا المبنى الرفيع، الذي كان في السابق كاتدرائية سان بول، تم بناؤه على أنقاض رومانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //245
            ["id" => "bb3f4b4a-c6f3-4558-b799-464b850fa051", "translation" => "The Roman theater is a living testament to the city's glorious past and a reminder of the rich cultural heritage that surrounds it. It is a must-visit destination for history and architecture enthusiasts, offering an immersive experience in the ancient Roman world.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3156aa78-020b-4cfd-8691-60b01ad4390c", "translation" => "Le théâtre romain est un témoignage vivant du passé glorieux de la ville et un rappel du riche patrimoine culturel qui l'entoure. C'est un lieu incontournable pour les amateurs d'histoire et d'architecture, offrant une expérience immersive dans le monde antique romain.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a64d8507-b86a-4714-a1e9-9a0a41619702", "translation" => "المسرح الروماني هو شاهد حي على مجد الماضي للمدينة وتذكير بالتراث الثقافي الغني الذي يحيط بها. إنه مكان لا غنى عنه لعشاق التاريخ والهندسة المعمارية، حيث يقدم تجربة غامرة في عالم الرومان القديم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //246
            ["id" => "323be048-c15d-4e6e-b1a3-ac8f8bfa52f3", "translation" => "The museum houses an extensive collection of historical artifacts, including sculptures, ceramics, jewelry, and everyday objects from the Roman era. Each object tells a unique story and allows visitors to delve into Cherchell's fascinating past.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0d6204b0-4d9b-42d2-a77e-fc05bb6ba77b", "translation" => "Le musée abrite une vaste collection d'artefacts historiques, notamment des sculptures, des céramiques, des bijoux et des objets quotidiens de l'époque romaine. Chaque objet raconte une histoire unique et permet aux visiteurs de plonger dans le passé fascinant de Cherchell.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "05612447-1fee-4ed5-b76a-a9ef25e36419", "translation" => "المتحف يضم مجموعة واسعة من القطع التاريخية، بما في ذلك التماثيل والسيراميك والمجوهرات والأشياء اليومية من عصر الرومان. كل قطعة تروي قصة فريدة وتتيح للزوار الانغماس في الماضي الرائع لشرشال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //247
            ["id" => "c4cc753a-1816-4feb-878c-231fc744211a", "translation" => "The Tipasa museum is a must-visit destination for history and archaeology enthusiasts. It offers a fascinating dive into the Roman past of the region and serves as a true window into the history and culture of Algeria.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bbac88f2-af74-4424-86d2-0b5d7da0038d", "translation" => "Le musée de Tipasa est un lieu incontournable pour les amateurs d'histoire et d'archéologie. Il offre une plongée fascinante dans le passé romain de la région et constitue une véritable fenêtre sur l'histoire et la culture de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "481f042b-9d8f-4d0b-b604-dd24d64b725d", "translation" => "متحف تيبازة هو وجهة لا غنى عنها لعشاق التاريخ والآثار. إنه يقدم نزولًا مثيرًا في الماضي الروماني للمنطقة ويعتبر نافذة حقيقية على تاريخ وثقافة الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //248
            ["id" => "45838567-861f-4e9e-b93c-0697c883a588", "translation" => "The archaeological site of Tipasa comprises one of the most extraordinary archaeological complexes in the Maghreb, including, among others, the amphitheater of Caesarea, the western baths, the arena, the western quarter of the city, and the necropolises.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bae7e592-9fde-43ab-a0a9-6edab07f8f38", "translation" => "Le site archéologique de Tipasa regroupe l'un des plus extraordinaires complexes archéologiques du Maghreb qui comprend entre autres, l’amphithéâtre de Caesarea,les thermes de l’ouest, l’arène, le quartier ouest de la ville et les nécropoles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dd7df35f-da50-4a08-bb53-e1b550987c63", "translation" => "موقع تيبازة الأثري يضم أحد أكثر المجمعات الأثرية الرائعة في المغرب، والتي تتضمن بين أمور أخرى مدرج قيصرية، والحمامات الغربية، والساحة الرياضية، وحي الغرب في المدينة، ومقابر القدماء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //249
            ["id" => "fba7d617-5bea-40ca-85af-8e4ca88663ad", "translation" => "Today, the royal mausoleum of Mauretania is listed as a UNESCO World Heritage Site and attracts visitors from around the world. It serves as a valuable testimony to the region's history and a symbol of the interaction between Roman and local cultures.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bd3fe639-ae4a-4aa2-9277-1701089a1861", "translation" => "Aujourd'hui, le mausolée royal de Maurétanie est inscrit sur la liste du patrimoine mondial de l'UNESCO et attire des visiteurs du monde entier. Il constitue un témoignage précieux de l'histoire de la région et un symbole de l'interaction entre les cultures romaine et locale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fdfdd3ed-fa78-44a6-9bd6-939a8541f6a0", "translation" => "اليوم، يُدرج الضريح الملكي الموريتاني على قائمة التراث العالمي لليونسكو وتجذب زوارًا من جميع أنحاء العالم. إنها شهادة قيمة على تاريخ المنطقة ورمز للتفاعل بين الثقافات الرومانية والمحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //250
            ["id" => "9f389836-2886-4d65-8f42-a6481936b794", "translation" => "The atmosphere on this beach is infused with the history and magic of ancient Rome. Visitors can stroll among the ruins, imagining the life and activities that once animated this place. It's an immersive experience that blends the natural beauty of the beach with the fascination of historical remnants.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ab793972-b7f9-41ce-b8fc-5375e58574b2", "translation" => "L'atmosphère qui règne sur cette plage est imprégnée de l'histoire et de la magie de l'ancienne Rome. Les visiteurs peuvent se promener entre les vestiges, imaginant la vie et les activités qui animaient autrefois cet endroit. C'est une expérience immersive qui mélange la beauté naturelle de la plage avec la fascination des vestiges historiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cb0d5d88-35f5-45cd-b25d-9147e43cca3a", "translation" => "الأجواء على هذا الشاطئ مشبوبة بتاريخ وسحر روما القديمة. يمكن للزوار التجول بين الأطلال، متخيلين الحياة والأنشطة التي كانت تحدث في هذا المكان في السابق. إنها تجربة غامرة تمزج بين جمال الطبيعة على الشاطئ وإعجاب الآثار التاريخية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //251
            ["id" => "5b355862-70ec-4ef1-ae9c-67ac8b72124c", "translation" => "This beach offers a complete experience, blending natural beauty, water activities, warm encounters, and moments of relaxation. It's the perfect place to rejuvenate, have fun, and connect with the surrounding nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cf235743-b25f-4403-9169-725e492f8e98", "translation" => "Cette plage offre une expérience complète, mêlant beauté naturelle, activités aquatiques, rencontres chaleureuses et moments de détente. C'est l'endroit idéal pour se ressourcer, se divertir et se connecter à la nature environnante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "56b07e99-bd72-4af2-b703-1ec7020ef54e", "translation" => "هذا الشاطئ يقدم تجربة كاملة، حيث يمزج بين جمال الطبيعة والأنشطة المائية واللقاءات وأوقات الاسترخاء. إنه المكان المثالي للتجديد والمرح وسط الطبيعة المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //252
            ["id" => "3b03eeb7-b818-4a6a-b641-2350600925f4", "translation" => "Whether you're a passionate horse lover or simply seeking a new and exciting experience, Tipasa Horses provides you with an exceptional opportunity to connect with nature, enjoy outdoor activity, and create lasting memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "41ad3b6d-9461-435f-b689-21809696290b", "translation" => "Que vous soyez un amoureux des chevaux passionné ou simplement à la recherche d'une expérience nouvelle et captivante. Le Tipasa Horses vous offre une opportunité exceptionnelle de vous connecter à la nature, de profiter d'une activité en plein air et de créer des souvenirs durables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5cd77d7b-e078-48b1-abb0-2354b80e28ff", "translation" => "سواء كنت من محبي الخيول أو ببساطة تبحث عن تجربة جديدة ومثيرة. تقدم لك خيول تيبازة فرصة استثنائية للتواصل مع الطبيعة والاستمتاع بالأنشطة الخارجية وخلق ذكريات دائمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //253
            ["id" => "8695aac7-e7e8-4777-83a2-d58c1faced88", "translation" => "Whether you're looking for thrills, family entertainment, or simply a moment of relaxation, the Tipasa Amusement Park is the perfect place to spend a memorable day.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2a9b57fb-e5af-45cf-8ec4-0e4eacff2865", "translation" => "Que vous soyez à la recherche de sensations fortes, de divertissements familiaux ou simplement d'un moment de détente, le parc d'attractions de Tipasa est l'endroit idéal pour passer une journée mémorable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d84a09ae-4413-49bf-9715-6ecb6b745e95", "translation" => "سواء كنت تبحث عن التشويق، أو ترفيه للعائلة، أو مجرد لحظة استرخاء، فإن حديقة التسلية في تيبازة هي المكان المثالي لقضاء يوم لا يُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //254
            ["id" => "439c9652-746e-4526-aca5-7e888f3b4c17", "translation" => "Upon your arrival, you will be impressed by the architecture of the building, which harmoniously blends modern elements with traditional influences. The center houses an extensive collection of artifacts, archaeological discoveries, and historical remnants that trace the history of the region from antiquity to the present day.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "72700f90-b35e-44f5-8ffa-0cfe02bca0f9", "translation" => "Dès votre arrivée, vous serez impressionné par l'architecture du bâtiment, qui allie harmonieusement des éléments modernes à des influences traditionnelles. Le centre abrite une vaste collection d'artefacts, de découvertes archéologiques et de vestiges historiques qui retracent l'histoire de la région depuis l'antiquité jusqu'à nos jours.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "053b5ec1-3116-4b25-9d70-262dd14d5bb2", "translation" => "عند وصولك، ستندهش من هندسة المبنى، التي تجمع بين العناصر الحديثة والتأثيرات التقليدية بشكل متناغم. يضم المركز مجموعة واسعة من القطع الأثرية والاكتشافات الأثرية وآثار تاريخية تتبع تاريخ المنطقة من العصور القديمة حتى الوقت الحالي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //255
            ["id" => "a34237f9-bb43-461a-9b12-421cfd0e4849", "translation" => "A space dedicated to environmental awareness and education. It is a place where visitors can discover and learn more about local biodiversity, environmental protection, and sustainable practices.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "efe2db4d-8cb5-4b6a-b306-2eb6b06bade9", "translation" => "Un espace consacré à la sensibilisation et à l'éducation environnementale. C'est un lieu où les visiteurs peuvent découvrir et apprendre davantage sur la biodiversité locale, la protection de l'environnement et les pratiques durables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f296d523-6f8a-458f-9d65-561aff0e1552", "translation" => "مساحة مخصصة للتوعية والتعليم البيئي. إنه مكان يمكن للزوار من خلاله اكتشاف والتعلم بشكل أعمق عن التنوع البيولوجي المحلي وحماية البيئة المستدامة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //256
            ["id" => "9ff63dc5-4efe-4884-9313-54eba76cb8f0", "translation" => "Whether it's for a family stroll, a relaxing picnic, or simply to admire the natural beauty of the surroundings, this park offers an ideal getaway to rejuvenate and cherish precious moments in the great outdoors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c56362d9-b346-493c-ab7f-7d21dac93d25", "translation" => "Que ce soit pour une promenade en famille, un pique-nique relaxant ou simplement pour admirer la beauté naturelle des lieux, ce parc offre une escapade idéale pour se ressourcer et profiter de moments précieux en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "86002eb4-f3c6-46fa-a406-1ed626e44dd5", "translation" => "سواء كان الأمر لنزهة عائلية، أو نزهة استرخائية، أو ببساطة للاستمتاع بجمال الطبيعة في المكان، تقدم هذه الحديقة مكانًا مثاليًا للابتعاد عن الروتين والاستمتاع بلحظات ثمينة في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //257
            ["id" => "e421fba6-61e7-4647-bf70-9181c7648f46", "translation" => "Whether it's a day trip with the family, a group outing, or simply to bask in the natural beauty of the region, the Boukourdane Dam has become a must-visit tourist destination for those seeking rejuvenation and a connection with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "88f27c9d-ac9b-421b-8c35-d5df381543d0", "translation" => "Que ce soit pour une escapade d'une journée en famille, une excursion en groupe ou simplement pour profiter de la beauté naturelle de la région, le barrage de Boukourdane est devenu une destination touristique incontournable pour ceux qui cherchent à se ressourcer et à se connecter avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "17c823af-32aa-454b-9bec-dc9ace79f7f8", "translation" => "سواء كان الأمر يتعلق برحلة يومية مع العائلة، أو نزهة جماعية، أو ببساطة للاستمتاع بجمال الطبيعة في المنطقة، أصبح سد بوكردان وجهة سياحية لا غنى عنها لأولئك الذين يبحثون عن التجديد والاستمتاع بالطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //258
            ["id" => "ff232025-8dcf-49e5-9c81-df624aa1dbb3", "translation" => "The peaceful atmosphere of the beach creates an environment conducive to relaxation and tranquility. Visitors can indulge in moments of reading, take a peaceful stroll along the coast, or simply lounge by the water while listening to the gentle sound of the waves.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "770fbf3a-e493-4064-b1b7-93306c125daa", "translation" => "L'atmosphère calme de la plage crée une ambiance propice à la détente et à la tranquillité. Les visiteurs peuvent s'adonner à des moments de lecture, faire une promenade paisible le long de la côte ou simplement se prélasser au bord de l'eau en écoutant le doux bruit des vagues.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4eae021f-fa48-4f64-89b3-31ec894b4c52", "translation" => "الأجواء الهادئة على الشاطئ تخلق جوًا مناسبًا للراحة. يمكن للزوار الاستمتاع بأوقات القراءة، والتجول الهادئ على طول الساحل، أو ببساطة الاسترخاء على حافة الماء مستمعين إلى صوت أمواجه اللطيف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //259
            ["id" => "165f8d3a-64a6-4118-af4b-2302feb8d358", "translation" => "Whether it's about relaxing, having fun, or simply enjoying the beauty of nature, this beach provides a tranquil haven where everyone can find their happiness.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1b3406c5-297c-4c8f-b348-3dae6d7e3da3", "translation" => "Qu'il s'agisse de se détendre, de se divertir ou de simplement profiter de la beauté de la nature, cette plage offre un refuge tranquille où chacun peut trouver son bonheur.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a335614c-e771-4410-a458-6d51231d09ac", "translation" => "سواء كان الأمر يتعلق بالاسترخاء، أو التسلية، أو ببساطة الاستمتاع بجمال الطبيعة، يقدم هذا الشاطئ ملاذًا هادئًا حيث يمكن للجميع أن يجد سعادته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //260
            ["id" => "9bc861f0-dafb-4610-9aa8-6f3dd88def39", "translation" => "The Abdelmajid Meziane national public museum is an iconic venue that highlights the rich cultural heritage of the region. Located in the heart of the city, the museum houses a diverse collection of artifacts and historical objects that trace the history and culture of Chlef and its surroundings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d17f1872-3b8a-4007-a93c-b5e30998cb9c", "translation" => "Le musée national public Abdelmajid Meziane est un lieu emblématique qui met en valeur le riche patrimoine culturel de la région. Situé au cœur de la ville, le musée abrite une collection diversifiée d'artefacts et d'objets historiques qui retracent l'histoire et la culture de Chlef et de ses environs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "353f1546-a9d0-47a4-b139-cddadc435da1", "translation" => "المتحف الوطني العمومي عبد المجيد مزيان هو مكان رمزي يبرز التراث الثقافي الغني للمنطقة. يقع في قلب المدينة، ويضم المتحف مجموعة متنوعة من القطع الأثرية والأشياء التاريخية التي تعكس تاريخ وثقافة شلف ومحيطها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //261
            ["id" => "1713a1c8-58d4-4e0a-a511-d55cab7b667c", "translation" => "Its main activities include the creation and dissemination of artistic and literary works, their promotion, arts and culture education, public reading, and the organization of exhibitions.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "329d004e-0d19-4def-b9a4-4036a0d25162", "translation" => "Son activité principale comprend la création et la diffusion d'œuvres artistiques et littéraires et leur encouragement, l'apprentissage des arts et culture, la lecture publique et l’organisation d’expositions.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d21a28fe-021d-4993-9924-285239a3530d", "translation" => "نشاطها الرئيسي يتضمن إنشاء ونشر الأعمال الفنية والأدبية وتشجيعها، وتعليم الفنون والثقافة، والقراءة العامة، وتنظيم المعارض.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //262
            ["id" => "a9201ae4-a06d-493d-ac80-ecb394e7561e", "translation" => "The museum's collections consist of archaeological artifacts, traditional objects, vintage photographs, and historical documents. Each displayed piece tells a unique story, providing visitors with the opportunity to explore and appreciate the cultural heritage of Tenes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "47f247e4-0c49-455e-bbd5-3a29a39a802e", "translation" => "Les collections du musée comprennent des artefacts archéologiques, des objets traditionnels, des photographies d'époque et des documents historiques. Chaque pièce exposée raconte une histoire unique, offrant aux visiteurs l'occasion de découvrir et d'apprécier le patrimoine culturel de Ténès.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fa9c6697-52bd-44cb-b397-a3da7337edae", "translation" => "تشمل مجموعات المتحف التحف الأثرية والأشياء التقليدية والصور القديمة والوثائق التاريخية. تحكي كل قطعة معروضة قصة فريدة من نوعها، مما يتيح للزوار فرصة اكتشاف وتقدير التراث الثقافي لمدينة تنس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //263
            ["id" => "9c8a2430-13d4-4281-a359-4f58e8e03f5e", "translation" => "The statue of the Virgin Mary in Tenes is a remarkable work of art that captures the attention and admiration of visitors. Located in a strategic position, the statue proudly stands on a hill overlooking the town, providing a panoramic view of the surroundings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f3e0f19e-35d3-4b6f-a595-f5e792337741", "translation" => "La statue de la Vierge Marie à Ténès est une œuvre remarquable qui attire l'attention et suscite l'admiration des visiteurs. Située dans un emplacement stratégique, la statue se dresse fièrement sur une colline surplombant la ville, offrant une vue panoramique sur les environs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "37a3a38c-ebe6-4b54-99a4-408e9c76bfd2", "translation" => "تمثال العذراء مريم في تنس هو عمل فني ملحوظ يستقطب انتباه الزوار وإعجابهم. يقع النصب التذكاري في مكان استراتيجي حيث يقف بفخر على تلة تطل على المدينة، مما يوفر منظرًا بانوراميًا للمناطق المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //264
            ["id" => "2ad71320-1c2f-4c4c-883e-9564bcfe39d9", "translation" => "The Tenes lighthouse is one of the oldest lighthouses in the country and a true symbol of the region. Perched atop a cliff, it majestically overlooks the Mediterranean Sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "06b9933d-2d54-49e9-adea-508d5e046bfe", "translation" => "Le phare de Ténès est l'un des phares les plus anciens du pays et un véritable symbole de la région. Construit au sommet d'une falaise, il domine majestueusement la mer Méditerranée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "18d461d1-a037-49d5-af85-12cef1d22a25", "translation" => "منارة تنس هي واحدة من أقدم المنارات في البلاد ورمز حقيقي للمنطقة. تم بناؤها على قمة صخرة مرتفعة، حيث تسهب بسيادتها على البحر الأبيض المتوسط بكل روعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //265
            ["id" => "9fb4b729-ccad-45e8-9e1d-b3b525bfd03a", "translation" => "The Sidi Merouane beach is a natural wonder offering a breathtaking landscape. Nestled at the foot of majestic cliffs, this rocky beach is a true hidden treasure.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9dfb89fc-0d0a-4cbc-809f-27fcace1b2f1", "translation" => "La plage de Sidi Merouane est une merveille naturelle offrant un paysage à couper le souffle. Nichée au pied de majestueuses falaises, cette plage rocheuse est un véritable trésor caché.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "be802ac3-a988-411e-bb0b-daccaae73409", "translation" => "شاطئ سيدي مروان هو عجب طبيعي يقدم مناظر خلابة. متواجدًا في قاعدة جبال صخرية مهيبة، يُعتبر هذا الشاطئ الصخري كنزًا مخفيًا حقيقيًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //266
            ["id" => "fdd8ef45-136a-40c5-9159-c395aa1801d8", "translation" => "A charming little public space that provides a welcome break in the heart of urban hustle and bustle.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "818aca9d-c404-4717-b622-e2f5eb5eb95e", "translation" => "Un charmant petit espace public qui offre une pause bienvenue au cœur de l'agitation urbaine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1f9e6d51-50e3-407e-8c69-841029725a61", "translation" => "مساحة عامة صغيرة وجذابة تقدم استراحة مرحبة في قلب صخب الحياة الحضرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //267
            ["id" => "94819a79-aabe-4295-91ef-b82d34edc6d8", "translation" => "This relic serves as a valuable reminder of the past and an opportunity to learn more about the region's history. It encourages reflection and invites visitors to imagine the life that once thrived in these places.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a1ca381b-6938-4c01-bd4b-4c291bb1057b", "translation" => "Ce vestige constitue un rappel précieux du passé et une occasion d'en apprendre davantage sur l'histoire de la région. Il incite à la réflexion et invite les visiteurs à imaginer la vie qui animait autrefois ces lieux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a91dae3b-aff6-4ebb-9a08-d94331f19d2f", "translation" => "هذا البقايا تمثل تذكيرًا قيمًا بالماضي وفرصة للتعرف على المزيد عن تاريخ المنطقة. إنها تحث على التفكير وتدعو الزوار لتخيل الحياة التي كانت تنشط في هذه الأماكن في السابق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //268
            ["id" => "4a4f0080-4da8-4837-9114-c2c97dd4c73d", "translation" => "The Colombi lighthouse is more than just a maritime landmark. It is an iconic monument that bears witness to the maritime history of the region and offers breathtaking panoramas. Whether it's to admire its imposing silhouette, enjoy the sea view, or simply connect with nature, the Colombi lighthouse is a must-visit when exploring El Marsa.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "60960c04-9a94-47a2-b730-ca8502cb2754", "translation" => "Le phare de Colombi est bien plus qu'un simple repère maritime. C'est un monument emblématique qui témoigne de l'histoire maritime de la région et qui offre des panoramas à couper le souffle. Que ce soit pour admirer sa silhouette imposante, profiter de la vue sur la mer ou simplement se connecter avec la nature, le phare de Colombi est un incontournable à découvrir lors d'une visite à El Marsa.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1846fb33-1e0b-47c5-9f6b-42ff8c5e352c", "translation" => "منارة كولومبي هي أكثر من مجرد علامة بحرية. إنها نصب تذكاري يشهد على تاريخ الملاحة في المنطقة وتقدم مناظر خلابة. سواء للتعجب من قامتها الضخمة، أو الاستمتاع بإطلالة على البحر، أو ببساطة التواصل مع الطبيعة، منارة كولومبي هي مكان يجب زيارته عند استكشاف منطقة المرسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //269
            ["id" => "c4a39c4e-f4d6-4c1f-a324-07be75818045", "translation" => "The mausoleum of Mama Binette is a place filled with spirituality and devotion. Nestled in the heart of a peaceful village, this mausoleum is a sanctuary preserved by the locals and visitors who come to discover or pay homage to Mama Binette, a respected spiritual figure.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e95c6b49-fab5-426c-a702-00d351bb151d", "translation" => "Le mausolée de Mama Binette est un lieu empreint de spiritualité et de dévotion. Niché au cœur d'un paisible village, ce mausolée est un sanctuaire préservé par les habitants et les visiteurs qui affluent pour découvrir ou rendre hommage à Mama Binette, une figure spirituelle respectée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7f812d8f-b31f-41c0-af6e-2d92dd8b48f7", "translation" => "ضريح ماما بينات هو مكان مليء بالروحانية والتفاني. يتواجد في قلب قرية هادئة، وهذا الضريح هو مأوى يحتفظ به السكان المحليين والزوار الذين يأتون لاستكشافه أو لتقديم الاحترام لماما بينات، شخصية محترمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //270
            ["id" => "14155485-e974-4693-a9f0-d205a5d07a9e", "translation" => "The club's facilities are modern and well-maintained, with all the necessary equipment at your disposal. Whether you are a beginner or an experienced diver, the Tenes Diving Club ensures you an unforgettable experience amidst the underwater wonders of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b511ca60-d6a8-4e28-ae34-3c42a5c2bc4c", "translation" => "Les installations du club sont modernes et bien entretenues, avec tout l'équipement nécessaire à votre disposition. Que vous soyez débutant ou plongeur expérimenté, le club de plongée de Tenes vous garantit une expérience inoubliable au cœur des merveilles sous-marines de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d323095d-6a5d-4ec2-86ba-f0c367274ec7", "translation" => "تتميز مرافق النادي بالحداثة والصيانة الجيدة، مع توفير جميع الأجهزة اللازمة لك. سواء كنت مبتدئًا أو غواصًا ذو خبرة، يضمن لك نادي الغوص في تنس تجربة لا تُنسى في قلب عجائب البحر في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //271
            ["id" => "38df7e12-2ee7-41cc-85c3-4733730f125d", "translation" => "While the historical details of this tower are shrouded in mystery, it serves as a tangible reminder of a distant past and piques the curiosity of visitors eager to uncover its secrets.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "02f35bf9-3f26-4baa-ad14-18d6830aef95", "translation" => "Bien que les détails historiques de cette tour soient enveloppés de mystère, elle constitue un rappel tangible d'un passé lointain et suscite la curiosité des visiteurs désireux de percer ses secrets.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bbc4a66d-4df6-4f0d-931b-802d75e995b8", "translation" => "بينما تكون تفاصيل التاريخ المتعلقة بهذا البرج ملفوفة بالغموض، إلا أنه يشكل تذكيراً ملموساً بماضٍ بعيد ويثير فضول الزوار الراغبين في كشف أسراره.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //272
            ["id" => "843f3777-25a6-4235-9c28-e3a605d18ff0", "translation" => "The chamber of crafts and trades of Tipasa is an iconic place dedicated to the preservation and promotion of traditional crafts in the region. Located in the heart of the city, this chamber provides a warm and welcoming space where visitors can explore local craftsmanship and admire the artisans' skills.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5fadfecd-c1e5-4e01-bc88-52d585a811fb", "translation" => "La Chambre de l'artisanat et des métiers de Tipasa est un lieu emblématique dédié à la préservation et à la promotion des métiers artisanaux traditionnels de la région. Située au cœur de la ville, cette chambre offre un espace chaleureux et accueillant où les visiteurs peuvent découvrir l'artisanat local et admirer le savoir-faire des artisans.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "42dd9f2b-c7a6-4a0b-8ce1-0ff330f60875", "translation" => "غرفة الصناعة والحرف في تيبازة هي مكان رمزي مخصص للحفاظ على وتعزيز الصناعات الحرفية التقليدية في المنطقة. يقع هذا المكان في قلب المدينة ويوفر مساحة دافئة ومرحبة حيث يمكن للزوار استكشاف الحرف اليدوية المحلية والتعرف على مهارات الحرفيين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //273
            ["id" => "90f49cd7-1c77-42f4-b103-df2072252e75", "translation" => "Whether it's a day of family fun, an outing with friends, or a special occasion, the Mostaland park is a must-visit destination that promises unforgettable moments. With its unique blend of thrills, wildlife discoveries, and relaxation spaces, it offers a comprehensive experience for all visitors, young and old alike.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2a56cbf2-1e39-4245-9459-3b4d3bd30287", "translation" => "Que ce soit pour une journée de divertissement en famille, une sortie entre amis ou une occasion spéciale, le Mostaland parc est un lieu incontournable qui promet des moments inoubliables. Avec son mélange unique de sensations fortes, de découvertes animalières et d'espaces de détente, il offre une expérience complète pour tous les visiteurs, jeunes et moins jeunes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d82561dc-8f2f-4e92-86e2-6af624b2fe38", "translation" => "سواء كنت تقضي يومًا من المرح العائلي أو نزهة مع الأصدقاء أو مناسبة خاصة، فإن حديقة موستالاند هي مكان لا يمكن تفويته ويعدك بلحظات لا تُنسى. ومع مزيجها الفريد من الإثارة واكتشافات الحياة البرية ومناطق الاسترخاء، فإنها توفر تجربة كاملة لجميع الزوار، صغارًا وكبارًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //274
            ["id" => "e10f12ac-60a3-4682-8872-6815b07821bd", "translation" => "A place steeped in history and memory, dedicated to the heroes and fighters of the Algerian war of national liberation. Located in the heart of the city, the museum is a true living testament to the struggle for independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d9adbc3b-e970-4797-9b8a-89e1dfc754a8", "translation" => "Un lieu chargé d'histoire et de mémoire, dédié aux héros et aux combattants de la guerre de libération nationale en Algérie. Situé au cœur de la ville, le musée est un véritable témoignage vivant de la lutte pour l'indépendance.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "13de2f11-4289-48e2-92c7-410e338463e5", "translation" => "مكان محمل بالتاريخ والذاكرة، مكرس لأبطال ومقاتلي حرب التحرير الوطني. يقع المتحف في قلب المدينة، وهو شاهد حي حقيقي على النضال من أجل الاستقلال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //275
            ["id" => "f6f4def6-621c-4546-945b-534535107e64", "translation" => "The structure of the fort is impressive, with its sturdy stone walls and imposing watchtowers. It bears witness to the military architecture of the time and its strategic significance in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2a5a4fc7-82ba-4ab2-8636-4645fe0c4b97", "translation" => "La structure du fort est impressionnante, avec ses murs en pierre solides et ses tours de guet imposantes. Il témoigne de l'architecture militaire de l'époque et de son importance stratégique dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "43131cd4-7eb1-4c10-87b1-0a32583b40a1", "translation" => "بنية القلعة مذهلة، مع جدرانها الصلبة المبنية من الحجر وأبراج المراقبة الضخمة. إنه يشهد على الهندسة العسكرية في تلك الحقبة وأهميتها الاستراتيجية في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //276
            ["id" => "61f62da3-4607-461a-a1a8-d44ae01cb393", "translation" => "Whether to attend a performance, participate in a workshop, or simply enjoy the artistic ambiance, the regional theater of Mostaganem is a must-visit place for arts and culture enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f3a131ec-0af9-4094-b0f2-4bda04fc6b68", "translation" => "Que ce soit pour assister à un spectacle, participer à un atelier ou simplement profiter de l'ambiance artistique, le théâtre régional de Mostaganem est un lieu incontournable pour les passionnés d'arts et de culture.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a72c5916-a953-4766-a450-e1726119f7b2", "translation" => "سواء كان ذلك لحضور عرض أو المشاركة في ورشة عمل أو ببساطة الاستمتاع بالأجواء الفنية، يعتبر مسرح مستغانم مكانًا لا غنى عنه لعشاق الفنون والثقافة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //277
            ["id" => "b4cdfdb9-9965-4009-bd9f-77da2f786a12", "translation" => "Located in the heart of the city, the chamber of crafts and trades houses a friendly and welcoming space where artisans can showcase their unique and authentic creations. You can find a variety of handmade artworks there, including pottery, carpets, jewelry, carved wooden items, and much more.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9392ecb5-baf3-4d0c-984e-7666b6a072a8", "translation" => "Située au cœur de la ville, la Chambre de l'artisanat et des métiers abrite un espace convivial et accueillant où les artisans peuvent exposer leurs créations uniques et authentiques. On y trouve une variété d'œuvres artisanales, telles que des poteries, des tapis, des bijoux, des objets en bois sculpté et bien plus encore.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "961d8ca6-fb83-4365-bbd9-860412e0adaf", "translation" => "تقع غرفة الصناعة والحرف في قلب المدينة، وهي تضم مكانًا وديًا ومرحبًا حيث يمكن للحرفيين عرض إبداعاتهم الفريدة والأصيلة. يمكنك العثور على مجموعة متنوعة من الأعمال الفنية اليدوية هناك، بما في ذلك الفخار، والسجاد، والمجوهرات، والأشياء المنحوتة من الخشب، والكثير غيرها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //278
            ["id" => "748eca80-c8f4-4961-8459-5f8cd40c2e84", "translation" => "The Cap Ivi lighthouse is an iconic maritime symbol of the region. It stands majestically atop a cliff, providing a panoramic view of the Mediterranean Sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f2a4031f-db5b-41d4-aac2-6441cc5bcdea", "translation" => "Le phare de Cap Ivi est un symbole maritime incontournable de la région. Il s'élève majestueusement au sommet d'une falaise, offrant une vue panoramique sur la mer Méditerranée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bc68f433-92dd-454c-aff3-1396abb3e484", "translation" => "منارة رأس إيفي هي رمز بحري لا غنى عنه في المنطقة. إنها تقف بعظمة على قمة جرف، مما يوفر إطلالة بانورامية على البحر الأبيض المتوسط.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //279
            ["id" => "1f00e88b-25e8-4105-ba3f-b3e49b9b7eb3", "translation" => "The Sayyida Khadija mosque is one of the oldest in Algeria. Its construction dates back to the 13th century CE, during the Zianide period. Despite the modest materials used, such as clay and stones, this mosque has withstood natural and human challenges for eight centuries.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f8ff9489-a521-48e5-a860-1d61b5deba83", "translation" => "La mosquée de sayyida Khadija est l'une des plus anciennes d'Algérie. Sa construction remonte au XIIIe siècle de notre ère, pendant la période Zianide. Malgré les matériaux modestes utilisés tels que l'argile et les pierres, cette mosquée a résisté aux aléas naturels et humains pendant huit siècles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e542acb1-8ae2-4e52-88ea-61e0ed0ffffd", "translation" => "مسجد السيدة خديجة هو واحد من أقدم المساجد في الجزائر. يعود بناؤه إلى القرن الثالث عشر الميلادي، خلال فترة الزيانيين. على الرغم من استخدام مواد متواضعة مثل الطين والحجارة، استمر هذا المسجد في مواجهة التحديات الطبيعية والبشرية لمدة ثمانية قرون.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //280
            ["id" => "c00a14cc-bcf8-453e-b716-b99de8ba865c", "translation" => "With its shaded pathways, welcoming benches, and flowerbeds, it provides a relaxing and peaceful space for visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3554a1e7-4563-4f5d-8609-f977d38769ad", "translation" => "Avec ses allées ombragées, ses bancs accueillants et ses parterres fleuris, il offre un espace de détente et de tranquillité aux visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8a445547-5ba3-4a21-b720-2b22e0465d94", "translation" => "مع ممراته المظللة ومقاعده الودية وأزهاره ، توفر مساحة للراحة والسكينة للزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //281
            ["id" => "4f90d82a-91a2-4a1f-951e-8b87bea57c12", "translation" => "Whether it's the latest international releases or local films, the cinema offers a diverse schedule that will cater to all tastes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "08764454-5350-4baa-832c-5bc29de7d05e", "translation" => "Que ce soit pour les dernières sorties internationales ou les films locaux, le cinéma propose une programmation variée qui saura satisfaire tous les goûts.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e8df489d-325f-458a-a5a7-a776f0e4b980", "translation" => "سواء كان الأمر يتعلق بآخر الأفلام العالمية أو الأفلام المحلية، يقدم السينما جدولًا متنوعًا سيكون قادرًا على إرضاء جميع الأذواق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //282
            ["id" => "aca14731-4697-47b5-889d-99c7eb4144cf", "translation" => "The wall of Sour is a tangible testament to the life and activity that has animated this region for centuries, reminding of the significance of its heritage and collective memory.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "722ebb8f-ce09-4bc6-8fb3-16a564e14380", "translation" => "La muraille de Sour est un témoignage tangible de la vie et de l'activité qui ont animé cette région depuis des siècles, rappelant l'importance de son patrimoine et de sa mémoire collective.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "25613c18-2532-48a0-b5e2-57c84b3055bc", "translation" => "سور الصور هو شاهد ملموس على الحياة والنشاط الذي شهدته هذه المنطقة على مر العصور، مشيرًا إلى أهمية تراثها وذاكرتها الجماعية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //283
            ["id" => "1b00dc30-3b1c-4383-8057-c81d11edb9de", "translation" => "Today, the Mostaganem city hall continues to fulfill its administrative role as the seat of the municipality, while also serving as an important symbol of the city's history and heritage. Its architectural beauty and central location make it a must-visit for visitors looking to discover the soul of this city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "de061c51-97b2-4c5d-b16f-ab45143f2f05", "translation" => "Aujourd'hui, l'hôtel de Ville de Mostaganem continue de remplir son rôle administratif en tant que siège de la municipalité, tout en étant un symbole important de l'histoire et du patrimoine de la ville. Sa beauté architecturale et son emplacement central en font un incontournable pour les visiteurs qui souhaitent découvrir l'âme de cette ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e0914307-1322-4bce-bf03-7b95a4d133fb", "translation" => "مبنى بلدية مستغانم ما زال يؤدي دوره الإداري كمقر للبلدية، بينما يعتبر أيضًا رمزًا هامًا لتاريخ المدينة وتراثها. جماله المعماري وموقعه المركزي يجعلانه وجهة لا غنى عنها للزوار الراغبين في اكتشاف جوهر هذه المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //284
            ["id" => "7ec82c59-4e58-40ba-b520-66373cdf321b", "translation" => "The municipality of Stidia is home to a must-visit site for all visitors: the Greenwich Tropic line. This line is one of the region's most important tourist attractions. Travelers are drawn to the opportunity to take a souvenir photo at this location.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5e1cfcff-f1f4-4924-8f1c-d068b7f3fd58", "translation" => "La commune de Stidia abrite un site incontournable pour tous les visiteurs : la ligne de Greenwich Tropic. Cette ligne représente l'une des attractions touristiques les plus importantes de la région. Les voyageurs sont attirés par l'opportunité de prendre une photo souvenir sur ce lieu.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4538a8c8-b1b3-4077-86a7-54929d24726a", "translation" => "بلدية ستيدية تحتضن موقعًا لا غنى عنه لجميع الزوار: خط الاستواء غرينتش. يُعتبر هذا الخط واحدًا من أهم معالم الجذب السياحي في المنطقة. يُجذب المسافرين بفرصة التقاط صورة تذكارية في هذا المكان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //285
            ["id" => "d0ed1648-1d84-4139-a4ee-53e00d3f4dd1", "translation" => "The Mazagran monument in Mostaganem is an iconic landmark commemorating a historic victory over the Spaniards. This imposing monument stands proudly, reminding of a decisive event in the region's history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6e9a473a-c359-4274-a3bc-4f336a4cd8d0", "translation" => "La stèle de Mazagran à Mostaganem est un monument emblématique qui commémore une victoire historique sur les Espagnols. Cette imposante stèle se dresse fièrement, rappelant un événement décisif de l'histoire de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "34030953-6a90-4ac6-be2b-eac59766734b", "translation" => "نصب مزغران في مستغانم هو معلم بارز يخلد انتصاراً تاريخياً على الإسبان. هذا النصب الرائع يقف بكبرياء، مُذكِّرًا بحدث مهم في تاريخ المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //286
            ["id" => "57b1daf4-e512-462a-a669-5e250c26900a", "translation" => "With its peaceful atmosphere, green landscapes, and friendly ambiance, the Bourahma recreational forest is a must-visit place to reconnect with nature and enjoy pleasant outdoor moments.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7222452e-193f-4b8b-8435-7030908a722f", "translation" => "Avec son atmosphère paisible, ses paysages verdoyants et son ambiance conviviale, la forêt récréative de Bourahma est un lieu incontournable pour se reconnecter avec la nature et passer des moments agréables en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "de09a830-0278-4bdd-a018-674eedb3dacd", "translation" => "مع جوها الهادئ ومناظرها الخضراء وجوها الودي، تعتبر غابة بورحمة الترفيهية مكانًا لا غنى عنه لإعادة الاتصال بالطبيعة وقضاء أوقات ممتعة في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //287
            ["id" => "440832af-34b0-4ae3-ab08-de6071ffa083", "translation" => "Whether you're a history enthusiast, an art lover, or simply curious to explore Algeria's cultural richness, this museum is a must-visit, providing an educational and inspiring experience for all visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "350ccafd-28ad-48ab-aeab-5f6367b82b21", "translation" => "Que l'on soit un passionné d'histoire, un amateur d'art ou simplement curieux de découvrir la richesse culturelle de l'Algérie, ce musée est un incontournable qui offre une expérience éducative et inspirante pour tous les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e48bef07-03b7-48a6-a61b-f7aa3726ea32", "translation" => "سواء كنت عاشقًا للتاريخ، أو محبًا للفن، أو مجرد فضولي يرغب في استكشاف الثراء الثقافي الجزائري، هذا المتحف هو وجهة لا غنى عنها تقدم تجربة تعليمية وملهمة لجميع الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //288
            ["id" => "6ffc74b4-a9b7-41da-9a5d-9d11105ccaaf", "translation" => "Whether you're a film enthusiast or simply looking for quality entertainment, the Murdjajo cinema is the perfect place to enjoy an immersive 3D cinematic experience that combines cutting-edge technology and comfort for an unforgettable experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5ea589a9-ac6c-4844-9b6d-c7a364efe779", "translation" => "Que l'on soit un passionné de cinéma ou simplement à la recherche d'un divertissement de qualité, le cinéma Murdjajo est l'endroit idéal pour profiter d'une expérience cinématographique immersive en 3D, alliant technologie de pointe et confort pour une expérience inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3d700081-8ac4-4fba-8926-5cdaca9a6a60", "translation" => "سواء كنت عاشقًا للسينما أو مجرد بحثًا عن ترفيه عالي الجودة، فإن سينما مرجاجو هي المكان المثالي للاستمتاع بتجربة سينمائية ثلاثية الأبعاد ممتعة تجمع بين أحدث التقنيات والراحة لتجربة لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //289
            ["id" => "4f87627b-68a7-4b2c-bd61-f192c5f5a2e1", "translation" => "The Es-Saàda hall is a versatile venue that hosts various artists and film screenings. It is a dynamic place that contributes to the cultural life of the region by providing a platform for artists and offering diverse artistic events.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "89ff19de-9ae3-45f3-b07d-739da528e246", "translation" => "La salle Es-Saàda est un lieu polyvalent qui accueille divers artistes et projections cinématographiques. C’est un lieu dynamique qui contribue à la vie culturelle de la région en offrant une plateforme aux artistes et en proposant des événements artistiques variés.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ed63c56b-06a2-4fe7-8c41-ceab8b00006a", "translation" => "قاعة السعادة هي مكان متعدد الاستخدامات يستضيف فنانين متنوعين وعروض سينمائية. هذا المكان الدينامي يسهم في الحياة الثقافية للمنطقة من خلال توفير منصة للفنانين وتقديم أحداث فنية متنوعة. ", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //290
            ["id" => "ff4b6358-0dee-4b16-8a7e-e8c620ae50e1", "translation" => "The cinematheque of Oran is an iconic venue for cinema enthusiasts in the city. It is dedicated to the preservation, promotion, and dissemination of cinematic heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1caaf8fb-c5cb-4085-823d-1ce095fd16bc", "translation" => "La Cinémathèque d'Oran est un lieu emblématique pour les amateurs de cinéma de la ville. Elle est dédiée à la préservation, à la promotion et à la diffusion du patrimoine cinématographique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "703b0d62-5593-4ebd-ad63-37964e82fce5", "translation" => "سينماتيك وهران هي موقع بارز لعشاق السينما في المدينة. إنها مكرسة للحفاظ على التراث السينمائي وتعزيزه ونشره.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //291
            ["id" => "f2ec949e-10b6-4679-864e-d229dcf3491c", "translation" => "This hall serves as a hub for cultural and artistic convergence, providing a platform for the dissemination of Algerian creativity in its various forms. The events organized in this venue offer an opportunity to celebrate and promote the richness of the national culture and art.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "294c8fa0-cbbe-45b2-88a3-b3e3c2ff6652", "translation" => "Cette salle constitue un lieu de convergence culturelle et artistique, offrant une plateforme pour la diffusion de la créativité algérienne sous ses diverses formes. Les événements organisés dans cette salle sont l'occasion de célébrer et de promouvoir la richesse de la culture et de l'art national.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "21f8e747-f45e-4558-9f99-111e8a79c975", "translation" => "هذا المكان يُعتبر محورًا للتلاقي الثقافي والفني، حيث يوفر منبرًا لنشر الإبداع الجزائري في مختلف أشكاله. الفعاليات التي يُنظمها في هذا المكان تمثل فرصة للاحتفال والترويج لثراء الثقافة والفن الوطني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //292
            ["id" => "da0d4541-951b-41f1-9fc1-53c79659b885", "translation" => "The Cinegold is a modern cinema venue that provides an exceptional entertainment experience. With its state-of-the-art facilities, high-quality screenings, and comfortable ambiance, it promises moviegoers an immersive and memorable cinematic experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5614a251-373a-438e-b806-5f89314404b0", "translation" => "Cinegold est un lieu de cinéma moderne qui offre une expérience de divertissement exceptionnelle. Avec ses installations de pointe, ses projections de qualité et son ambiance confortable, il promet aux spectateurs une expérience cinématographique immersive et mémorable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c93657ef-0d23-43ce-9342-7f1aa1e390c3", "translation" => "سينيقولد وهران هو مكان حديث يقدم تجربة ترفيه استثنائية. بفضل مرافقه المتطورة وعروضه عالية الجودة وأجوائه المريحة، يعد هذا المكان تجربة سينمائية غامرة ولا تُنسى للجماهير.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //293
            ["id" => "e30a50f6-0e08-43a8-9121-83dcd0f5929f", "translation" => "The Santa Cruz fort, perched majestically on a mountain overlooking the bay, is more than just a fortress. With its imposing architecture and picturesque chapel, it is a true historical gem and an iconic landmark of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d21ad26d-b39d-43ae-a252-80c43c61ed98", "translation" => "Le fort Santa Cruz, perché majestueusement sur une montagne surplombant le golfe, est bien plus qu'une simple forteresse. Avec son architecture imposante et sa chapelle pittoresque, il constitue un véritable joyau historique et un point de repère emblématique de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "676dca6e-a94e-4458-b864-64f06b7294dc", "translation" => "قلعة سانتا كروز، الموجودة على قمة الجبل بفخر والتي تطل على الخليج، هي أكثر من مجرد حصن. بفضل هندستها المهيبة وكنيستها الجميلة، فهي جوهرة تاريخية حقيقية وعلامة بارزة في المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //294
            ["id" => "06a6e171-2416-4895-9849-246b2edadf41", "translation" => "The Santa Cruz chapel in Oran is an architectural treasure located within the Santa Cruz fort. This charming chapel, nestled atop the mountain overlooking the city, provides a unique spiritual and visual experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3f7bf8a5-61ab-4660-80f3-d7ec74196317", "translation" => "La Chapelle Santa Cruz d'Oran est un trésor architectural situé au sein du fort Santa Cruz. Cette charmante chapelle, nichée au sommet de la montagne qui domine la ville, offre une expérience spirituelle et visuelle unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6b3530b7-4154-48db-8d7a-1ab526435cc8", "translation" => "كنيسة سانتا كروز هي كنز معماري يقع داخل حصن سانتا كروز. هذه الكنيسة الجميلة، الموجودة على قمة الجبل الذي يتحكم في المدينة، توفر تجربة روحية و بصرية فريدة من نوعها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //295
            ["id" => "79e493c8-2f4c-4af9-94da-3dc282997abe", "translation" => "The Saint Louis church is a splendid church located in the heart of the city. While it can only be admired from the outside, it never fails to impress with its architectural magnificence and rich history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "990f09ab-0472-4cea-b784-213dd79423cd", "translation" => "L'église Saint Louis est une splendide église située au cœur de la ville. Bien qu'elle ne puisse être contemplée que de l'extérieur, elle ne manque pas d'impressionner par sa magnificence architecturale et son histoire riche.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f8784595-55ba-427e-a473-915fb8a48d24", "translation" => "كنيسة سان لويس هي كنيسة رائعة تقع في قلب المدينة. على الرغم من أنه يمكن مشاهدتها فقط من الخارج، إلا أنها لا تفوت بإبهارها بمهيبها المعماري وتاريخها الغني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //296
            ["id" => "d5d05953-d6ae-4e2b-a2fa-63a39513f42d", "translation" => "Whether you're a history enthusiast, an architecture aficionado, or simply curious about exploring the local culture, the door of Santon is a must-visit that invites you to embrace the city's heritage and immerse yourself in its authentic charm.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4d7bcf5a-892f-4612-b843-e6f5e997200e", "translation" => "Que vous soyez un amateur d'histoire, un passionné d'architecture ou simplement curieux de découvrir la culture locale, la porte du Santon est un incontournable qui vous invite à embrasser l'héritage de la ville et à vous immerger dans son charme authentique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2756b84a-cc90-4422-a9c4-566a879f81e4", "translation" => "سواء كنت عاشقًا للتاريخ، أو متحمسًا للهندسة المعمارية، أو مجرد فضولي لاكتشاف الثقافة المحلية، فإن بوابة سانتون هي وجهة لا غنى عنها تدعوك لاحتضان تراث المدينة والانغماس في سحرها الأصيل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //297
            ["id" => "01f19647-28fc-4fdf-9eef-69f8ac140a50", "translation" => "The Santiago fort is an imposing fortress that bears witness to the rich and tumultuous history of the region. Perched atop a hill, this fort provides a panoramic view of the city and its surroundings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "09702a99-1619-421c-9bbd-ad1f226313c8", "translation" => "Le fort Santiago est une forteresse imposante qui témoigne de l'histoire riche et mouvementée de la région. Situé au sommet d'une colline, ce fort offre une vue panoramique sur la ville et les environs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "26d16354-34e3-4d8a-ad7d-84ba28657b9d", "translation" => "تعتبر قلعة سانتياغو قلعة مهيبة تشهد على تاريخ المنطقة الغني و الحافل بالأحداث. يقع هذا الحصن على قمة تل، ويوفر إطلالات بانورامية على المدينة والمناطق المحيطة بها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //298
            ["id" => "7304a1a8-dcad-44f8-812a-3510bfe00ff3", "translation" => "The gate of Spain, a true architectural gem, is a must-visit for anyone looking to explore the history and cultural richness of Oran. Whether to admire its impressive architecture, learn more about its fascinating past, or simply soak in its history-laden atmosphere, this captivating gate is sure to leave a lasting impression on those who behold it.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d6bbba67-78dc-4f87-9638-93b89e99d458", "translation" => "La porte d'Espagne, véritable joyau architectural, est un incontournable pour tous ceux qui souhaitent explorer l'histoire et la richesse culturelle d'Oran. Que ce soit pour admirer son architecture impressionnante, pour en apprendre davantage sur son passé fascinant ou simplement pour s'imprégner de son atmosphère chargée d'histoire, cette porte fascinante ne manquera pas de laisser une impression durable dans les esprits de ceux qui la contemplent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1f4ab62d-86a3-4a9d-835f-8fc9ff885f69", "translation" => "بوابة إسبانيا، جوهرة معمارية حقيقية، هي وجهة لا غنى عنها لجميع من يرغبون في استكشاف تاريخ وثقافة وهران الغنية. سواء كان لمعاينة هندستها المذهلة، أو لمعرفة المزيد عن ماضيها الرائع، أو حتى للانغماس بأجواءها التي تحمل بصمات التاريخ، فإن هذه البوابة الساحرة لن تترك سوى انطباع دائم في أذهان أولئك الذين يراقبونها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //299
            ["id" => "2d142e8b-d588-4902-abe9-0a387d11b171", "translation" => "The San Jose drum is much more than a mere entrance; it is the gateway to an underground network of paramount significance. This network, consisting of 500 meters of meticulously constructed tunnels by civil defense services, stands as a true symbol of resilience and preparedness in the face of potential threats.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "93f24658-a66f-4de5-b700-7071b282f670", "translation" => "Le Tambour San José est bien plus qu'une simple entrée, c'est le point d'accès vers un réseau souterrain d'une importance capitale. Ce réseau, composé de 500 mètres de galeries soigneusement aménagées par les services de la défense passive, représente un véritable symbole de la résilience et de la préparation face aux menaces potentielles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "70dafd6f-73c8-44f2-bb7a-ed7ae1685633", "translation" => "طبل سان خوسي هو نقطة الوصول إلى شبكة تحت الأرض ذات أهمية كبيرة. تتألف هذه الشبكة من 500 متر من الممرات التي تم تجهيزها بعناية بواسطة خدمات الدفاع المدني، وتمثل رمزًا حقيقيًا للصمود والاستعداد في وجه التهديدات المحتملة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //300
            ["id" => "ded31c76-697b-495f-8762-afcae417b5bf", "translation" => "Former cathedral transformed into a library, it is much more than just a place for preserving books; it is a true heritage and intellectual gem of the city. It embodies the commitment to preserving collective memory, promoting reading and access to knowledge, and fostering the intellectual growth of the community.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "642775e2-a023-4cb4-8a6b-11aeba74fe19", "translation" => "Ancienne cathédrale transformée en bibliothèque, elle est bien plus qu'un simple lieu de conservation de livres, c'est un véritable joyau patrimonial et intellectuel de la ville. Elle incarne la volonté de préserver la mémoire collective, de promouvoir la lecture et l'accès à la connaissance, et de favoriser l'épanouissement intellectuel de la communauté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "710ac6b0-88b8-4b1a-a202-fd53a6a7e828", "translation" => "كاتدرائية سابقة تحولت إلى مكتبة، إنها أكثر من مكان للحفاظ على الكتب، جوهرة حقيقية من التراث والفكر في المدينة. إنها تجسد التزامًا بالحفاظ على الذاكرة الجماعية، وتعزيز القراءة والوصول إلى المعرفة، وتعزيز النمو الفكري للمجتمع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //301
            ["id" => "af3a187c-e8b3-48a5-b06b-8b00a8d237b5", "translation" => "The Ibn Badis promenade is a true asset for the city of Oran, providing residents and visitors with a space for relaxation, recreation, and connection with nature. Whether for a peaceful stroll, an invigorating sports session, or simply to recharge while admiring the sea, this promenade is a must-visit place to enjoy the city's charms.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "98b7a004-c4c6-4842-a971-74e7c797ac72", "translation" => "La promenade Ibn Badis est un véritable atout pour la ville d'Oran, offrant aux habitants et aux visiteurs un espace de détente, de loisirs et de connexion avec la nature. Que ce soit pour une balade tranquille, une séance de sport revitalisante ou simplement pour se ressourcer en admirant la mer, cette promenade est un lieu incontournable pour profiter des charmes de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a2bff3c0-52f5-463a-b4b2-641fc91b0d9f", "translation" => "حديقة إبن باديس أصل حقيقي لمدينة وهران، حيث تقدم للسكان والزوار مكانًا للراحة والترفيه والتواصل مع الطبيعة. سواء للنزهة الهادئة، أو لجلسة رياضية منعشة، أو ببساطة للاسترخاء أثناء مشاهدة البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //302
            ["id" => "9909f5b8-3aef-4ace-8dde-7a3f41bb117a", "translation" => "Visiting the Bey's palace is like delving into the history and elegance of a bygone era. It's an opportunity to discover the sumptuous architecture and artistic treasures that characterized the lives of Oran's former elites. A must-visit place for history and art enthusiasts looking to explore the cultural richness of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3221fccb-78d3-42b0-a77d-2bccb92fe0ff", "translation" => "Visiter le palais du Bey, c'est plonger dans l'histoire et l'élégance d'une époque révolue. C'est découvrir l'architecture somptueuse et les trésors artistiques qui ont marqué la vie des anciennes élites d'Oran. Un lieu incontournable pour les amateurs d'histoire et d'art qui souhaitent explorer les richesses culturelles de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "12380df8-e06b-449a-8574-9a36314677c4", "translation" => "زيارة قصر الباي تعني أنك تغوص في تاريخ وأناقة عصر مضى. إنها فرصة لاكتشاف العمارة الفخمة والكنوز الفنية التي ميزت حياة الطبقة الراقية السابقة في وهران. مكان لا غنى عنه لعشاق التاريخ والفن الذين يتطلعون لاستكشاف الثراء الثقافي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //303
            ["id" => "bda89024-f392-46a5-b8ed-e98cec9c0646", "translation" => "The open-air theater is an enchanted space where the city's most beautiful outdoor galas take place. It is an iconic venue that embodies the passion and artistic enthusiasm of the people of Oran.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "59b38ca7-c7f1-4f2b-9ff9-fe3df27a8e29", "translation" => "Le Théâtre de Verdure est un espace enchanté où se déroulent les plus beaux galas en plein air de la ville. C'est un lieu emblématique qui incarne la passion et l'effervescence artistique des Oranaises et des Oranais.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ac39bb97-581a-4d70-8439-d70f05680815", "translation" => "مسرح الهواء الطلق هو مكان ساحر حيث تقام أجمل الحفلات الخارجية في المدينة. إنه مكان رمزي يجسد شغف وحماس الفنانين والفنانات في وهران.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //304
            ["id" => "66a7ba7f-bc0b-4983-a1bd-fa413cf9ea34", "translation" => "The Pacha mosque, built in 1796, is a historical treasure that bears witness to the city's cultural richness. Standing in front of the mosque, one can admire its traditional architecture, with its arabesque forms and delicate decorative elements. However, the ravages of time and weather damage have left their mark on the walls and architectural details.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6cf4d866-89b6-4bdb-9e7f-aa998ceccec7", "translation" => "La mosquée du Pacha, érigée en 1796, est un trésor historique qui témoigne de la richesse culturelle de la ville. En se tenant devant la mosquée, on peut admirer son architecture traditionnelle, avec ses formes arabesques et ses éléments décoratifs délicats. Cependant, l'usure du temps et les dommages causés par les intempéries ont laissé leur empreinte sur les murs et les détails architecturaux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0e91f5ef-33fc-4ab4-88ba-16a34743d1c4", "translation" => "مسجد الباشا, الذي شُيِّد في عام 1796، هو كنز تاريخي يشهد على ثراء ثقافة المدينة. عند الوقوف أمام الجامع، يمكن للزائر أن يعجب بعمارته التقليدية، بأشكالها العربية وعناصرها الزخرفية الدقيقة. ومع ذلك، فقد تركت أثرها على الجدران والتفاصيل المعمارية بفعل مرور الزمن والأضرار الناجمة عن العوامل الجوية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //305
            ["id" => "e48cc108-2161-4023-b0b1-640aa8472b5a", "translation" => "Whether to discover new artistic trends, participate in trade fairs, or attend performances, the Oran exhibition palace is a must-visit venue that contributes to the cultural and economic life of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a30ce37a-ae79-4d0c-a317-9c1dedff3a31", "translation" => "Que ce soit pour découvrir de nouvelles tendances artistiques, participer à des foires commerciales ou assister à des spectacles, le palais des expositions d'Oran est un lieu incontournable qui contribue à la vie culturelle et économique de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1450d2f1-3880-43d2-b59b-610779acdb65", "translation" => "سواء لاكتشاف اتجاهات فنية جديدة أو المشاركة في المعارض التجارية أو حضور العروض، فإن قصر المعارض في وهران هو مكان لا غنى عنه يسهم في الحياة الثقافية والاقتصادية للمدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //306
            ["id" => "7018ca30-6e38-45a1-8652-dd8c4079a787", "translation" => "The Oran convention center is an internationally renowned architectural gem, housing the convention center, the exhibition palace, and the 'Le Méridien' hotel. This impressive complex is among the largest convention centers in Africa.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3c6011d5-cacf-4e9f-967c-82c8272459c8", "translation" => "Le Centre de Conventions d'Oran est un joyau architectural de renommée internationale, regroupant le palais des congrès, le palais des expositions et l'hôtel 'Le Méridien'. Cet impressionnant complexe est parmi les plus grands centres de conventions d'Afrique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "49cea0ed-80b1-4d6d-ab6f-6a84801fab79", "translation" => "مركز المؤتمرات وهران هو جوهرة معمارية مشهورة عالميًا، يضم قاعة المؤتمرات، وقصر المعارض. هذا المجمع الرائع يعتبر واحدًا من أكبر مراكز المؤتمرات في إفريقيا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //307
            ["id" => "64a4e6a3-7787-463b-88a7-2a7751be3843", "translation" => "The modern art museum is a place where art unfolds in all its splendor, captivating visitors and inviting them to reflect and feel. Whether one is an art connoisseur or simply curious, this museum offers an enriching and inspiring experience for all contemporary art enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "54916417-2b43-44e5-8af0-adc55f0dd628", "translation" => "Le musée d'art moderne d'Oran est un lieu où l'art se révèle dans toute sa splendeur, captivant les visiteurs et les invitant à réfléchir et à ressentir. Que l'on soit un connaisseur d'art ou simplement curieux, ce musée offre une expérience enrichissante et inspirante pour tous les passionnés d'art contemporain.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cb6e9259-f4bf-475e-b749-ddc3fe127a71", "translation" => "متحف الفن الحديث مكان اين يكشف الفن عن جماله بأكمله، مبهماً الزوار ومستدركاً لهم للتفكير والشعور. سواء كنت عبارة عن خبير في الفن أو مجرد فضولي، يقدم هذا المتحف تجربة غنية وملهمة لجميع عشاق الفن المعاصر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //308
            ["id" => "e0531190-c81f-4ddc-9eff-f784639a9ec2", "translation" => "The regional theater of Oran is much more than just a building. It is a magical place where art comes to life, captivating the audience and nourishing the soul. Whether you are a theater enthusiast or simply an admirer of the arts, this majestic venue is a must-visit destination for all stage lovers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f1d5498b-84f6-4040-9752-faf89868478e", "translation" => "Le théâtre régional d'Oran est bien plus qu'un simple bâtiment. C'est un lieu magique où l'art s'exprime, captivant le public et nourrissant l'âme. Que l'on soit passionné de théâtre ou simple amateur des arts, ce lieu majestueux est une destination incontournable pour tous les amoureux de la scène.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e1a633da-70c5-4ace-9043-e4ac03c0be1e", "translation" => "المسرح الجهوي لوهران هو أكثر من مجرد مبنى. إنه مكان سحري حيث يتجسد الفن، مسحوراً الجمهور ومغذياً للروح. سواء كنت متحمسًا للمسرح أو مجرد عاشق للفنون، فإن هذا المكان الرائع هو وجهة لا بد من زيارته لجميع عشاق المسرح.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //309
            ["id" => "7c224593-3fe6-4a86-a5c6-3135191f0f2d", "translation" => "The Oran city hall is an imposing building located in the heart of the city. With its majestic architecture, it serves as both an architectural landmark and a seat of governance where decisions are made and the city's affairs are managed.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b0222209-c5a8-4d14-b9ad-747f17b48bb8", "translation" => "L'hôtel de ville d'Oran est un imposant édifice situé au cœur de la ville. Avec son architecture majestueuse, il est à la fois un repère architectural et un lieu de gouvernance où les décisions sont prises et les affaires de la ville sont gérées.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d5158b8a-6997-4775-bf31-664167a0b49b", "translation" => "البلدية في وهران مبنى كبير يقع في قلب المدينة. بفضل هندسته المهيبة، إنه علامة معمارية بارزة ومكان لإدارة الحكومة حيث تُتخذ القرارات وتُدير شؤون المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //310
            ["id" => "2379db65-7aaf-4c92-937a-874fa725f1ec", "translation" => "The November 1, 1954 Square is a spacious esplanade, reminiscent of the famous theater square in Algiers. Surrounded by a charming garden, it provides visitors and residents of Oran with a pleasant setting to relax and enjoy the surroundings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1b0e5177-02e5-4939-abff-5b21c4460c5f", "translation" => "La place du 1er Novembre 1954 est une vaste esplanade, rappelant la célèbre place du théâtre d'Alger. Entourée d'un charmant jardin, elle offre aux visiteurs et aux habitants d'Oran un cadre agréable pour se détendre et profiter des lieux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7b4d0603-b1dc-4414-8062-6472355b9fda", "translation" => "ساحة 1 نوفمبر 1954 هي ساحة واسعة، تُذكر بساحة المسرح الشهيرة في الجزائر. محاطة بحديقة ساحرة، توفر للزوار وسكان وهران بيئة ممتعة للاسترخاء والاستمتاع بالمحيط.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //311
            ["id" => "6ae0ba45-1a0f-4a66-a180-14b577848a6b", "translation" => "The Abdallah ben Salem mosque, once a synagogue, is a place steeped in history and spirituality. This religious building, with its unique charm, bears witness to the cultural and religious diversity of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7e9c15cd-8f84-4aab-9dd7-f7dd6eb0560d", "translation" => "La mosquée Abdallah ben Salem, autrefois une synagogue, est un lieu empreint d'histoire et de spiritualité. Cet édifice religieux, au charme particulier, témoigne de la diversité culturelle et religieuse de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "87f6a82e-39c9-4544-bf31-7f132acc70e1", "translation" => "جامع عبد الله بن سالم، الذي كان في السابق كنيسة يهودية، هو مكان محمل بالتاريخ والروحانية. هذا المبنى الديني، بجاذبيته الخاصة، يشهد على التنوع الثقافي والديني في المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //312
            ["id" => "1e75ef9f-197e-48c3-b4e7-32905ee4471a", "translation" => "The arenas of Oran is an architectural gem with a unique character in Algeria and on the African continent. Located in the southwest of the city, this circular building is steeped in history and traditions related to bullfighting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "15f4164e-09c0-42e6-8ef1-b5231295c6e3", "translation" => "Les arènes d'Oran sont un joyau architectural au caractère unique en Algérie et sur le continent africain. Situé dans le sud-ouest de la ville, ce bâtiment circulaire est chargé d'histoire et de traditions liées aux courses de taureaux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bd46e29e-2c62-478c-ac2c-19e517cbe27e", "translation" => "حلبة الثيران في وهران هي جوهرة معمارية ذات طابع فريد في الجزائر وعلى القارة الإفريقية. تقع في جنوب غرب المدينة، وهذا المبنى الدائري محمل بالتاريخ والتقاليد المرتبطة بفن الثيران.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //313
            ["id" => "ab93bad7-06a1-47f7-a8d6-8922a39dda89", "translation" => "Whether you're an avid art enthusiast or simply curious to explore new forms of artistic expression, the Kour art gallery is a must-visit. It's a place where creativity is celebrated, and emotions are evoked through fascinating works of art.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7acd17dc-abe5-41a4-ab10-372efe989d5c", "translation" => "Que vous soyez un amateur d'art chevronné ou simplement curieux de découvrir de nouvelles formes d'expression artistique, la Galerie d'art Kour est un incontournable. C'est un lieu où la créativité est célébrée et où les émotions sont suscitées à travers des œuvres d'art fascinantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b52e2acb-d890-4ea3-bee9-e4cbcb3e515f", "translation" => "سواء كنت من عشاق الفن المتمرسين أم مجرد فضولي لاكتشاف أشكال جديدة للتعبير الفني، رواق الفن كور هو وجهة لا بد من زيارتها. إنه مكان حيث يتم الاحتفال بالإبداع وتنبض الأعمال الفنية الرائعة بالمشاعر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //314
            ["id" => "bd3bab23-5482-4d1f-929a-41bab497dfbf", "translation" => "The garden of the Arab nation is a true urban paradise that will astonish you with its beauty and unique location. Located in the heart of the city, amidst the surrounding buildings, it provides a surprising natural experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "46e726e8-1a7d-4c90-a7f3-ac5e1daca814", "translation" => "Le jardin de la nation Arabe est un véritable paradis urbain qui vous étonnera par sa beauté et son emplacement unique. Situé au cœur de la ville, entre les immeubles environnants, il offre une expérience naturelle surprenante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "611d2873-f644-4ed6-825b-cf88f7c65a23", "translation" => "حديقة الأمة العربية ستدهشك بجمالها وموقعها الفريد. تقع في قلب المدينة، وسط المباني المحيطة، وتقدم تجربة طبيعية مدهشة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //315
            ["id" => "1894e052-9a9b-40ab-994b-481ca457697e", "translation" => "The Oran amusement park is a place of joy and excitement. It's a place where families and friends come together to create unforgettable moments. The park is filled with vibrant colors, thrilling rides, and a festive atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dd2245fe-d1f8-4104-8bad-269ba2de9acc", "translation" => "Le parc d'attractions d'Oran est un endroit où règne la joie et l'excitation. C'est un lieu où les familles et les amis se retrouvent pour passer des moments inoubliables. Le parc est rempli de couleurs vives, de manèges palpitants et d'une atmosphère festive.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6bd4dc5b-0a8c-4f16-98ac-b654a673c714", "translation" => "حديقة التسلية في وهران هي مكان يملؤه الفرح والإثارة. إنه المكان الذي تجتمع فيه العائلات والأصدقاء لصنع لحظات لا تُنسى. المدينة مليئة بالألوان الزاهية والألعاب المثيرة وأجواء احتفالية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //316
            ["id" => "efb77f9c-061a-49d4-bbe0-6412f40a4fe9", "translation" => "Whether you're an art enthusiast or simply curious to explore new forms of expression, the Civ-Oeil art gallery is a must-visit place in Oran. Come and be swept away by the emotion and beauty of the artworks surrounding you.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a7501b4e-1a64-4439-9ef9-483ccbc01815", "translation" => "Que vous soyez un passionné d'art ou simplement curieux de découvrir de nouvelles formes d'expression, la galerie d'art Civ-Oeil est un lieu incontournable à Oran. Venez et laissez-vous emporter par l'émotion et la beauté des œuvres qui vous entourent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0f21b089-5c98-44de-9f13-30d40c7055ad", "translation" => "سواء كنت من عشاق الفن أو مجرد فضولي لاكتشاف أشكال جديدة من التعبير، فإن هذا المعرض الفني هو مكان لا بد من زيارته في وهران. تعال واستمتع بمشاعر وجمال الأعمال الفنية المحيطة بك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //317
            ["id" => "148db0ed-8f16-49e0-948f-3bb3fef3a316", "translation" => "The Cayla garden is a true haven of peace in the heart of the city. Nestled amidst buildings and bustling streets, it provides a green refuge where visitors can escape the hustle and bustle of urban life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a3c20815-db74-4f94-a116-4bf6022a5d4c", "translation" => "Le jardin Cayla est un véritable havre de paix au cœur de la ville. Niché entre les immeubles et les rues animées, il offre un refuge verdoyant où les visiteurs peuvent échapper à l'agitation de la vie urbaine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c8e8b977-5006-4eb4-847b-dfb0cf03bd0d", "translation" => "حديقة كايلا هي ملاذ حقيقي للسلام في قلب المدينة. موجودة بين المباني والشوارع الحيوية، توفر مأوىًا أخضرًا حيث يمكن للزوار الهروب من صخب الحياة الحضرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //318
            ["id" => "3ad77928-f231-4164-8235-d00d6f7354fb", "translation" => "Whether it's for a family outing or simply to escape the hustle and bustle of the city, the Mediterranean garden provides an ideal setting to relax and enjoy.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "03436b69-c35a-494f-823d-fc20ccb57442", "translation" => "Que ce soit pour une sortie en famille ou simplement pour échapper à l'agitation de la ville, le Jardin méditerranéen offre un cadre idéal pour se ressourcer et se divertir.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "842c4066-34e3-4f34-94ab-019ee8a52df2", "translation" => "سواء كان للخروج مع العائلة أو ببساطة للهروب من صخب المدينة، تقدم حديقة البحر المتوسط إطارًا مثاليًا للاسترخاء والتمتع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //319
            ["id" => "90fa206c-1a3d-42bc-8e1b-fb5949ced4a8", "translation" => "The Sidi Mhamed garden is a true gem offering breathtaking views of the sea and the bustling city center of Oran. With its well-maintained 6 hectares of promenades, this green space is a prime location to relax and soak in the Mediterranean atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e8062b19-d369-4a6e-bafc-84a87e7cb563", "translation" => "L'esplanade Sidi Mhamed est un véritable joyau offrant une vue imprenable sur la mer et le centre-ville animé d'Oran. Avec ses 6 hectares de promenades bien entretenues, cet espace verdoyant est un lieu privilégié pour se détendre et profiter de l'atmosphère méditerranéenne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "054beeaf-b60a-4099-a665-613eda1cf75b", "translation" => "حديقة سيدي محمد جوهرة حقيقية تقدم مناظر خلابة للبحر ووسط مدينة وهران المزدحمة. بفضل 6 هكتارات من الممرات المحافظة بعناية، تعتبر هذه المساحة الخضراء موقعًا رئيسيًا للاسترخاء والاستمتاع بالأجواء البحرية الرائعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //320
            ["id" => "848a7036-fbc9-4d03-9706-527cec6c3925", "translation" => "The Dayet Morsli lake is a true natural treasure that attracts visitors in search of tranquility and beauty. Nestled in the heart of a picturesque landscape, it remains an ideal place to rejuvenate in nature, far from the hustle and bustle of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8f4bc3bb-ccf6-459f-b9e7-8dff353f3169", "translation" => "Le lac Dayet Morsli est un véritable trésor naturel qui attire les visiteurs en quête de calme et de beauté. Niché au cœur d'un paysage pittoresque, il reste un lieu idéal pour se ressourcer en pleine nature, loin du tumulte de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "70e9fb21-a13d-4a83-b850-2d7e2a563c22", "translation" => "بحيرة ضاية مرسلي هي كنز طبيعي حقيقي يجذب الزوار الذين يبحثون عن الهدوء والجمال. موجودة في قلب مناظر طبيعية خلابة، تظل مكانًا مثاليًا للاستجمام في الطبيعة، بعيدًا عن صخب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //321
            ["id" => "8f4d884a-e72e-4c73-8912-ba74c6e0cf39", "translation" => "The Oran sebkha is a unique place, offering a one-of-a-kind experience and a natural spectacle to admire. It's an invitation to contemplation, discovery, and meditation in the heart of this natural wonder.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "03310805-5bb9-4c1c-930d-3136f3f9da21", "translation" => "La sebkha d'Oran est un lieu à part, offrant une expérience unique et un spectacle naturel à admirer. C'est une invitation à la contemplation, à la découverte et à la méditation au cœur de cette merveille naturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bc09e9fd-ab01-4c7f-8645-69d4c491b4bb", "translation" => "سبخة وهران هي مكان فريد، تقدم تجربة فريدة من نوعها وعرضًا طبيعيًا للتعجب. إنها دعوة للتأمل والاكتشاف والتأمل في قلب هذه العجب الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //322
            ["id" => "bac5cc4d-49d4-4892-9e3b-42033de54a28", "translation" => "The Mers el Kebir fort is a captivating historical site that combines history, architecture, and natural beauty. It's a place that transports visitors through time and invites them to discover the rich heritage of Oran and its surrounding regions.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7f852b53-22d2-4539-82a8-d1d717fec9cd", "translation" => "Le fort de Mers el Kébir est un site historique captivant qui allie histoire, architecture et beauté naturelle. C'est un lieu qui transporte les visiteurs à travers le temps et les invite à découvrir le riche patrimoine d'Oran et de ses régions environnantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dd3eb08b-2e9a-4d26-bd22-03c558d37090", "translation" => "قلعة مرسى الكبير هي موقع تاريخي مسلٍّ يجمع بين التاريخ والهندسة المعمارية والجمال الطبيعي. إنه مكان ينقل الزوار عبر الزمن ويدعوهم لاستكشاف التراث الغني لوهران ومناطقها المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //323
            ["id" => "01942e59-4549-4596-91eb-b7c6693bc2ed", "translation" => "The Oran zoological park is a captivating place where nature and wildlife converge. Located in a green setting, this zoo offers visitors a unique experience by bringing them closer to fascinating animals from around the world.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7b14c0d6-40e7-4677-8211-1441e23b5bcd", "translation" => "Le parc zoologique d'Oran est un lieu captivant où la nature et la faune se rencontrent. Situé dans un cadre verdoyant, ce zoo offre aux visiteurs une expérience unique en les rapprochant d'animaux fascinants venant du monde entier.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "25bd5f3c-bbc2-485f-93bf-429dfc6e2bad", "translation" => "حديقة الحيوانات في وهران هي مكان جذاب حيث تتقاطع الطبيعة والحياة البرية. تقع هذه الحديقة في إطار خضراء وتقدم للزوار تجربة فريدة عن طريق التقرب من الحيوانات الرائعة من جميع أنحاء العالم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //324
            ["id" => "6c4813f7-3fda-43a1-b4cd-364efc01eea7", "translation" => "The Roman ruins of Portus Magnus are a must-visit for history enthusiasts and archaeology buffs. It's a place that allows you to delve into the fascinating past of the Roman Empire and appreciate the cultural and historical richness of Algerian territory.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fc6f1aea-7aeb-4dc2-9a73-c4c31d0872d2", "translation" => "Les ruines romaines de Portus Magnus sont un incontournable pour les amateurs d'histoire et les passionnés d'archéologie. C'est un lieu qui permet de se plonger dans le passé fascinant de l'empire romain et d'apprécier la richesse culturelle et historique du territoire algérien.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0dccec15-d6cd-479a-b797-e2a00e5dcf3c", "translation" => "آثار بورتوس ماغنوس الرومانية هي وجهة لا غنى عنها لعشاق التاريخ وعشاق علم الآثار. إنه مكان يسمح للزوار بالانغماس في الماضي الساحر للإمبراطورية الرومانية وتقدير الثراء الثقافي والتاريخي للأراضي الجزائرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //325
            ["id" => "72389ef3-4a15-4de5-b307-cabfaa64c69f", "translation" => "The Saïd Gharbaoui square, located in the heart of the city, is an iconic and historically rich place in Oran. It's a lively and vibrant space where the past and present come together harmoniously.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "46efac65-f239-4e38-afb5-0a8b75e94ec9", "translation" => "La place Saïd Gharbaoui, située au cœur de la ville, est un lieu emblématique chargé d'histoire à Oran. C'est un espace vivant et vibrant, où le passé et le présent se rejoignent harmonieusement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9ea75688-920f-4b08-8a3b-c8382ea409ce", "translation" => "ساحة سعيد غرباوي، الموجودة في قلب المدينة، هي مكان رمزي ذو تاريخ غني في وهران. إنها مساحة حية ونابضة بالحياة، حيث يتلاقى الماضي والحاضر بانسجام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //326
            ["id" => "6de5c12f-8d72-40cb-9b01-1661e94b971a", "translation" => "The Turkish baths of Oran, built in 1708 by Bey Bouchlaghem of Mascara, are an architectural gem steeped in history. These ancient public baths have retained their authentic charm despite the passage of years. The establishment is now occupied by the Santé Sidi El Houari Association.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8a843689-2937-41b4-8879-06d4a8a4f472", "translation" => "Les bains turcs d'Oran, érigés en 1708 par le Bey Bouchlaghem de Mascara, sont un joyau architectural chargé d'histoire. Ces anciens bains publics ont conservé leur charme authentique malgré le passage des années. L'établissement est aujourd’hui occupé par l’association Santé Sidi El Houari.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e892bc9a-8fd5-4866-b3f3-131481e30ebe", "translation" => "الحمامات التركية في وهران، التي بُنيت في عام 1708 من قبل الباي بوشلاغم من معسكر، هي جوهرة معمارية مشحونة بالتاريخ. حافظت هذه الحمامات العامة القديمة على سحرها الأصيل على الرغم من مرور السنين. يتم اليوم احتلال المنشأة من قبل جمعية صحة سيدي الهواري.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //327
            ["id" => "27149ca9-a0a9-4c5f-aa3c-dc955e7d059e", "translation" => "The palace of culture and arts is an iconic building that embodies the cultural richness of the city. Located in the heart of Oran, this palace provides a space dedicated to artistic creation and cultural enrichment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "adc00f36-a26c-4ac6-902b-ad7402be7f61", "translation" => "Le Palais de la culture et des arts est un édifice emblématique qui incarne la richesse culturelle de la ville. Situé au cœur d'Oran, ce palais offre un espace dédié à la création artistique et à l'épanouissement culturel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6b4b31b8-f381-49ff-926b-6716fcd7c8d3", "translation" => "قصر الثقافة والفنون هو مبنى رمزي يجسد ثراء الثقافة في المدينة. يقع في قلب وهران، يوفر هذا القصر مساحة مخصصة للإبداع الفني والثراء الثقافي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //328
            ["id" => "aa991979-7724-406e-9f6f-be2840b207c4", "translation" => "Whether you're an experienced hiker or simply seeking a peaceful getaway in nature, the Tafraoui Canyon is the perfect place to rejuvenate and connect with the wild beauty of the region. It's a true haven of tranquility where you can escape the hustle and bustle of daily life and get lost in the majesty of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7ec789d9-3c9b-4a76-b341-e74fda860bca", "translation" => "Que l'on soit un randonneur chevronné ou simplement en quête d'une escapade tranquille en pleine nature, le canyon de Tafraoui est l'endroit idéal pour se ressourcer et se connecter avec la beauté sauvage de la région. C'est un véritable havre de paix où l'on peut s'évader du tumulte de la vie quotidienne et se perdre dans la majesté de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "be6aa692-a8f1-4a15-bf04-24413ca97ae2", "translation" => "سواء كنت متجردًا من المشي أو تبحث عن استراحة هادئة في الطبيعة، فإن كانيون طفراوي هو المكان المثالي للاسترخاء والاتصال بجمال الطبيعة في المنطقة. إنه ملاذ حقيقي للسلامة حيث يمكنك الهروب من صخب الحياة اليومية والانغماس في عظمة الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //329
            ["id" => "a2f9bb26-b0a6-458f-9600-089dcd31cc97", "translation" => "Whether you're a photography enthusiast in search of unique landscapes, a passionate ornithologist, or simply looking for a peaceful nature experience, the Arzew salt flats provide a refreshing and captivating getaway. It's a true natural treasure to discover in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2abe13cf-f5a4-4c61-b182-3e25073a2080", "translation" => "Que l'on soit un amateur de photographie à la recherche de paysages uniques, un passionné d'ornithologie ou simplement en quête d'une expérience apaisante en pleine nature, les salines d'Arzew offrent une escapade rafraîchissante et captivante. C'est un véritable trésor naturel à découvrir dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4aecf4f0-ba2f-4875-b6f9-0d95e695a921", "translation" => "سواء كنت عاشقًا للتصوير تبحث عن مناظر فريدة، أو مهتمًا بعلم الطيور، أو مجردا يبحث عن تجربة مهدئة في الطبيعة، فإن مستنقعات أرزيو تقدم لك فرصة هادئة وجذابة. إنها كنز طبيعي حقيقي يمكن اكتشافه في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //330
            ["id" => "a5b20ced-1ae3-4dce-8fee-a8582ce789ed", "translation" => "Whether you're looking for a peaceful stroll, a relaxing fishing session, or simply to enjoy the serenity and beauty of the landscape, the Telamine lake is a true haven of peace in the region. It's a place not to be missed for nature lovers and those seeking a moment of tranquility in the heart of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "783893a1-f5e2-423d-9a49-e01c58cc0625", "translation" => "Que ce soit pour une promenade paisible, une session de pêche relaxante ou simplement pour profiter du calme et de la beauté du paysage, le lac Télamine est un véritable havre de paix dans la région. C'est un endroit à ne pas manquer pour les amoureux de la nature et ceux en quête d'un moment de tranquillité au cœur de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "417d7110-967b-48e6-9bbd-a2c0f1e2804a", "translation" => "سواء كنت تبحث عن نزهة هادئة، أو جلسة صيد مريحة، أو ببساطة للاستمتاع بالسكينة وجمال المناظر الطبيعية، فإن بحيرة تيلامين هي ملاذ حقيقي للسلام في المنطقة. إنها مكان لا يجب تفويته لعشاق الطبيعة وأولئك الذين يبحثون عن لحظة من الهدوء في قلب الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //331
            ["id" => "91d9f163-fe65-4828-b926-415bf17c3651", "translation" => "While the ruins of Siga are now quiet and peaceful, they serve as an evocative reminder of the city's glorious past. Whether you're a history enthusiast, an archaeology buff, or simply a curious traveler, a visit to this site will transport you to another time and help you grasp the significance of this ancient city in the region's history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0c0c7289-5149-4fbe-affa-7c34c3c04cde", "translation" => "Bien que les ruines de Siga soient aujourd'hui silencieuses et paisibles, elles constituent un rappel évocateur du passé glorieux de cette cité. Que vous soyez un passionné d'histoire, un amateur d'archéologie ou simplement un voyageur curieux, une visite de ce site vous transportera dans un autre temps et vous permettra de saisir l'importance de cette cité antique dans l'histoire de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3403ff56-dc85-4fc8-b5f8-173a4ab920b3", "translation" => "على الرغم من أن أطلال سيقا هادئة اليوم، إلا أنها تشكل تذكيرًا مؤثرًا بالماضي المجيد لهذه المدينة. سواء كنت عاشقًا للتاريخ، أو مهتمًا بعلم الآثار، أو ببساطة مسافرًا فضوليًا، فإن زيارة هذا الموقع ستنقلك إلى زمن آخر و ستساعدك على فهم أهمية هذه المدينة القديمة في تاريخ المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //332
            ["id" => "191dac76-0064-46a6-94b6-fdb9ac81223c", "translation" => "A visit to the Mausoleum of Beni Rhenane provides a unique opportunity to explore a historically significant site, bearing witness to the region's past grandeur and piquing the curiosity of history and archaeology enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "117d34ce-aca0-45c5-aa6b-9e0d3f514357", "translation" => "Une visite au Mausolée de Beni Rhénane offre une occasion unique de découvrir un site historique d'une grande importance, témoignant de la grandeur passée de la région et suscitant la curiosité des amateurs d'histoire et d'archéologie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "983ebd98-d7b8-43a6-aaa2-d4b8feb295c7", "translation" => "زيارة ضريح بني رنان توفر فرصة فريدة لاستكشاف موقع تاريخي ذو أهمية كبيرة، يشهد على عظمة المنطقة في الماضي ويثير فضول عشاق التاريخ وعلم الآثار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //333
            ["id" => "79998a5d-14c6-499f-b2b5-f0e656d5e0e4", "translation" => "Rachgoun Island is a true haven of peace where serenity reigns. Its tranquil and unspoiled atmosphere makes it a prime destination for rejuvenation and reconnecting with nature. Whether it's a family getaway or a solo escape, it offers a memorable experience in the heart of a pristine natural environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "729dbdf5-53d4-42ab-b45f-a62bbd4be292", "translation" => "L'île de Rachgoun est un véritable havre de paix où règne la sérénité. Son atmosphère tranquille et préservée en fait un lieu de choix pour se ressourcer et se connecter avec la nature. Que ce soit pour une escapade en famille ou une simple évasion en solitaire, elle offre une expérience mémorable au cœur d'un environnement naturel préservé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e8e2e4d7-3a89-4ca8-bbc2-73e969a21263", "translation" => "جزيرة رشقون هي ملاذ حقيقي للسلام حيث تسود السكينة. جوهرها الهادئ والمحافظ عليها يجعلها وجهة مثالية للاسترخاء وإعادة الاتصال بالطبيعة. سواء كان ذلك لقضاء عطلة عائلية أو للهروب بمفردك، إلا أنها تقدم تجربة لا تُنسى في قلب بيئة طبيعية نقية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //334
            ["id" => "b69b3de9-cda9-4a8c-9cb0-6293dcfe3ef9", "translation" => "Whether you admire it from the surrounding waters or get up close, the lighthouse of Rachgoun Island impresses with its imposing presence and vital role in maritime safety. It is a true testament to the past and an icon of the island.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e57deb22-d4bb-44a3-bfa5-e06d20728f73", "translation" => "Que vous l'admiriez depuis les eaux environnantes ou que vous vous approchiez de près, le phare de l'île de Rachgoun impressionne par sa présence imposante et son rôle vital dans la sécurité maritime. C'est un véritable témoignage du passé et une icône de l'île.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9724625f-5834-4336-ad1b-9216f888f22d", "translation" => "سواء كنت تعجب به من المياه المحيطة أو أنك تقترب منه، يثير منارة جزيرة رشقون الإعجاب بوجودها الساحر والدور الحيوي الذي تلعبه في الأمان البحري. إنها شاهد حقيقي على الماضي ورمز للجزيرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //335
            ["id" => "fa1950cc-110a-41ef-8105-cdd79500cc21", "translation" => "The former church, now known as the Hamza Ibn Abdelmoutaleb mosque, is a place of worship steeped in history and transformation. Its architecture bears witness to its Christian past, with characteristic elements of western religious architecture. This mosque is a living testament to the cultural developments and changes over time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d557a9e0-69ce-4c94-986e-91c44501c2ad", "translation" => "L'ancienne église devenue la Mosquée Hamza Ibn Abdelmoutaleb est un lieu de culte empreint d'histoire et de transformation dont l'architecture témoigne de son passé chrétien avec des éléments caractéristiques de l'architecture religieuse occidentale. Cette mosquée est un témoignage vivant des évolutions et des changements culturels au fil du temps.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4410303d-77fe-47f8-8065-b765346491ae", "translation" => "الكنيسة السابقة، التي أصبحت الآن تعرف بمسجد حمزة بن عبد المطلب، هي مكان عبادة مشبع بالتاريخ والتحول. تحمل هندستها شهادة على ماضيها المسيحي، مع عناصر مميزة من الهندسة الدينية الغربية. هذا الجامع هو شاهد حي على التطورات الثقافية والتغيرات عبر الزمن.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //336
            ["id" => "f7da74a2-a0f7-4b40-b0aa-e8ff657bcf22", "translation" => "The Bouhadjar thermal resort is a true haven of peace where one can rejuvenate and treat various health issues thanks to the therapeutic properties of natural hot springs. It's the perfect place to relax, heal, and regain balance while enjoying the natural and soothing environment of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c23363ca-57bb-4d43-a816-95c62596338b", "translation" => "La station thermale de Bouhadjar est un véritable havre de paix où l'on peut se ressourcer et traiter divers problèmes de santé grâce aux propriétés thérapeutiques des sources chaudes naturelles. C'est l'endroit idéal pour se détendre, se soigner et retrouver son équilibre tout en profitant de l'environnement naturel et apaisant de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "623ecbaf-b958-420c-a9dd-18a5b4480c1f", "translation" => "منتجع بوحجر هو ملاذ حقيقي للسلام حيث يمكن للزائر أن يجدد نشاطه ويعالج مشاكل الصحة المتنوعة بفضل الخصائص العلاجية للينابيع الحارة الطبيعية. إنه المكان المثالي للاسترخاء والعلاج واستعادة التوازن بينما يستمتع بالبيئة الطبيعية الهادئة والمهدئة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //337
            ["id" => "3bce89df-7384-4d90-97d2-95b6ec773854", "translation" => "This garden is a soothing and welcoming green space, perfect for relaxation and outdoor leisure activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9f470cdf-3135-4335-bfd3-cfc4d7ce7af2", "translation" => "Ce jardin est un espace de verdure apaisant et convivial, propice à la détente et aux loisirs en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ba72f71e-3507-414d-99e2-6419d22e0864", "translation" => "هذه الحديقة مساحة خضراء مهدئة ومرحبة، مثالية للاسترخاء وأنشطة الترفيه في الهواء الطلق", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //338
            ["id" => "ec78a452-2bfc-4e46-a1cc-cdb528e34f5e", "translation" => "Beyond its majestic architectural appearance, this former church remains a witness to the region's past and invites reflection on the cultural and religious heritage of El Malah.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0aebc844-784b-40cf-b50b-195d1ab4b444", "translation" => "Au-delà de son aspect architectural majestueux, cette ancienne église reste un témoin du passé de la région et invite à la réflexion sur le patrimoine culturel et religieux d'el Malah.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0436877a-9ad5-464c-a691-3a8ad57161c2", "translation" => "بالإضافة إلى مظهرها المعماري الرائع، تظل هذه الكنيسة القديمة شاهدًا على ماضي المنطقة وتدعو إلى التأمل في التراث الثقافي والديني لمنطقة المالح.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //339
            ["id" => "1e2bf76d-9ef7-4a42-a09f-a9f4afb3b404", "translation" => "The central square is a lively and friendly place, where local life is in full swing. It's an essential meeting point for the city's residents and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b0110819-64d7-443e-a947-97814a816a5f", "translation" => "La place centrale est un lieu animé et convivial, où la vie locale bat son plein. C'est un point de rencontre incontournable pour les habitants et les visiteurs de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "edf06466-da97-43e2-8a55-4beb3f35ca8f", "translation" => "الساحة المركزية هي مكان حيوي وودي، حيث تزخر الحياة المحلية. إنها نقطة اللقاء الأساسية لسكان المدينة والزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //340
            ["id" => "6c1b1870-1b51-4c74-8845-98326974c14f", "translation" => "Although the province boasts several beautiful beaches that attract thousands of vacationers, the zaouia of Sidi Yakoub, built in the 14th century, is a true architectural masterpiece that remains the most visited religious and tourist monument by the local residents throughout the year.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3cd11089-cb1d-4738-bd9a-d995a29de750", "translation" => "Même si la wilaya possède plusieurs belles plages qui attirent des milliers d’estivants, la Zaouia de Sidi Yakoub, construite au 14ème siècle est un véritable chef-d’œuvre architectural qui reste le monument religieux et touristique le plus visité par les habitants de la région durant toute l’année.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ddbf3271-f0c7-4df6-a704-ae18ca7e2b84", "translation" => "على الرغم من وجود العديد من الشواطئ الجميلة في الولاية التي تجذب الآلاف من العطل، إلا أن زاوية سيدي يعقوب، التي بنيت في القرن الرابع عشر، هي تحفة معمارية حقيقية تظلّ النصب الديني والسياحي الأكثر زيارة من قبل السكان المحليين طوال العام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //341
            ["id" => "13ff2dde-aa4d-4b8d-92ae-38034e25a11c", "translation" => "A monument that pays tribute to the illustrious Numidian king. The stele is a valuable testament to the ancient history of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "924e1864-e24b-4204-be90-3ddb7d16962c", "translation" => "Un monument qui rend hommage à l'illustre roi numide. La stèle est un témoignage précieux de l'histoire ancienne de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a0c28e89-622d-41df-b127-2cb574714b83", "translation" => "معلم يكرم الملك النوميدي الشهير. النصب الجامعي هو شهادة قيمة على تاريخ المنطقة القديم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //342
            ["id" => "d466ca02-5d88-4c9a-a69f-a89554705363", "translation" => "The Rachgoun forest is an ideal place to enjoy nature, have a picnic, and spend quality time with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3e740158-673d-471a-bf9c-84c64caeb61b", "translation" => "La forêt de Rachgoun est un lieu idéal pour profiter de la nature, savourer un bon repas en plein air et passer du temps de qualité en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8e43d7f4-c384-4f72-9a83-15ac0eaacff9", "translation" => "غابة رشقون هي مكان مثالي للاستمتاع بالطبيعة، وتناول وجبة خفيفة في الهواء الطلق، وقضاء وقت جيد مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //343
            ["id" => "ff414441-024d-4dd2-98aa-2782645eb985", "translation" => "A place of memory and contemplation where visitors can pay tribute to the heroes and reflect on the struggle for independence. The museum plays a crucial role in preserving collective memory and transmitting this heritage to future generations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e3c18262-97df-4774-a1a2-1d7a3ed4e93d", "translation" => "Un lieu de mémoire et de recueillement où les visiteurs peuvent rendre hommage aux héros et réfléchir sur le combat pour l'indépendance. Le musée joue un rôle essentiel dans la préservation de la mémoire collective et dans la transmission de cet héritage aux générations futures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "60e10ae3-986a-4550-8cbd-c5008cb935cc", "translation" => "مكان للذكرى والتأمل حيث يمكن للزوار تقديم الاحترام للأبطال والتفكير في النضال من أجل الاستقلال. يلعب المتحف دورًا حاسمًا في الحفاظ على الذاكرة الجماعية ونقل هذا التراث إلى الأجيال القادمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //344
            ["id" => "3494a8e7-98c0-4579-8d5e-ddd1a0185bec", "translation" => "The raw and wild beauty of the surrounding landscape provides a striking contrast to the abandoned industrial structures. Photography enthusiasts will find an endless source of evocative and captivating images here.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d9c040c4-3bd4-43b7-8ef3-c0697181f3c3", "translation" => "La beauté brute et sauvage du paysage environnant offre un contraste frappant avec les structures industrielles abandonnées. Les amateurs de photographie trouveront ici une source inépuisable d'images évocatrices et captivantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ada401bf-98cf-4e6e-97a2-2cbb86be8b52", "translation" => "جمال المناظر الطبيعية الخامة والبرية المحيطة يوفر تباينًا بارزًا مع الهياكل الصناعية المهجورة. سيجد عشاق التصوير هنا مصدرًا لا ينضب من الصور المثيرة والمؤثرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //345
            ["id" => "820e56dd-b4e1-41f4-8be9-697c844c398d", "translation" => "These imposing gates symbolize the military architecture of the time. They stand as a testament to the strategic significance of the region and the efforts made to protect the surrounding cities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "21406b01-3906-4cb4-a737-46387e83b558", "translation" => "Ces portes imposantes représentent un symbole de l'architecture militaire de l'époque. Elles sont un témoignage de l'importance stratégique de la région et de l'effort déployé pour la protection des cités environnantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f9fde6fa-4a3a-4d2b-b2a0-e1e88f583989", "translation" => "هذه الباب الضخمة تمثل رمزًا للهندسة العسكرية في تلك الفترة. إنها تشكل شهادة على أهمية استراتيجية المنطقة والجهد المبذول لحماية المدن المجاورة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //346
            ["id" => "e3b443c6-fe88-4e8e-a747-f9aae0f8d2d5", "translation" => "El Mechouar palace is an iconic place that combines history, architecture, and art. It is a must-visit for culture and aesthetics enthusiasts, providing a fascinating and immersive experience in the architectural and cultural heritage of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9d7e9bea-0d45-45c7-a8d5-7c51868b5579", "translation" => "Le palais d'El Mechouar est un lieu emblématique qui allie l'histoire, l'architecture et l'art. Il constitue une visite incontournable pour les amateurs de culture et d'esthétique, offrant une expérience fascinante et immersive dans l'héritage architectural et culturel de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0b4b86df-3ec9-4122-820e-2388951918fb", "translation" => "قصر المشور هو مكان رمزي يجمع بين التاريخ والفن. زيارته لا غنى عنها لعشاق الثقافة والجمال، حيث يقدم تجربة مثيرة وغامرة في التراث المعماري والثقافي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //347
            ["id" => "2955490d-2997-4f65-9909-2d241fc90151", "translation" => "This place serves as a venue for learning, discovering, and appreciating Algeria's rich clothing heritage. It offers an immersive cultural experience that allows visitors to gain a better understanding and appreciation of the significance of traditional attire in Algerian cultural identity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "95e804a3-3c99-4851-b14d-8e07d065c930", "translation" => "Ce lieu constitue un lieu d'apprentissage, de découverte et d'appréciation du riche patrimoine vestimentaire de l'Algérie. C'est une expérience culturelle immersive qui permet aux visiteurs de mieux comprendre et d'apprécier l'importance du costume traditionnel dans l'identité culturelle algérienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1b1e02c3-4f80-44f9-897b-8fa23a73ae21", "translation" => "هذا المكان يعتبر مكانًا للتعلم والاكتشاف والتقدير للتراث الملابس الغني في الجزائر. إنها تجربة ثقافية غامرة تسمح للزوار بفهم أفضل وتقدير أهمية الزي التقليدي في الهوية الثقافية الجزائرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //348
            ["id" => "d1f8af58-c7bc-4798-badd-3b8c9340b387", "translation" => "A true architectural gem, reflecting the elegance and authenticity of traditional Moorish baths. Constructed with simple materials such as clay, brick, and artistic ceramics, this establishment bears witness to the ingenuity of artisans of the time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ae4a57d0-d101-4991-852b-3970731e0d94", "translation" => "Un véritable joyau architectural, reflétant l'élégance et l'authenticité des bains maures traditionnels. Construit avec des matériaux simples tels que l'argile, la brique et la céramique artistique, cet établissement témoigne de l'ingéniosité des artisans de l'époque.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8debe92a-3a6b-441d-97d2-4eb5d122011c", "translation" => "جوهرة معمارية حقيقية، تعكس أناقة وأصالة الحمامات الشرقية التقليدية. تم بناؤها باستخدام مواد بسيطة مثل الطين والطوب والخزف الفني، وتشهد هذه المنشأة على ذكاء حرفيي تلك الحقبة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //349
            ["id" => "a522c73a-2db1-43bd-8b8b-ba7357794957", "translation" => "The ruins of Mansourah are a must-visit historical site in Tlemcen, offering visitors a unique opportunity to discover and appreciate the cultural heritage of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f3a3c452-9404-4ee6-a02b-17ed5cdc7b4b", "translation" => "Les ruines de Mansourah sont un site historique incontournable à Tlemcen, offrant aux visiteurs une occasion unique de découvrir et d'apprécier le patrimoine culturel de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "53f33ad0-0414-4fb0-a04a-c1e1716594d0", "translation" => "آثار المنصورة هي موقع تاريخي لا غنى عن زيارته في تلمسان، حيث تقدم للزوار فرصة فريدة لاكتشاف وتقدير التراث الثقافي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //350
            ["id" => "c890abac-c141-4808-badb-cdfa9afad5ba", "translation" => "Whether you're an animal enthusiast or simply seeking a relaxing nature getaway, the Mansourah zoo park is an ideal destination for the whole family.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b108630c-c939-4311-97ec-b7cb7f6b92fc", "translation" => "Que vous soyez amateur d'animaux ou simplement en quête d'une escapade relaxante en pleine nature, le zoo Mansourah Park's est une destination idéale pour toute la famille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7fc87078-80b1-4577-bded-b37b4b2202b8", "translation" => "سواء كنت عاشقًا للحيوانات أو تبحث فقط عن هروب مريح في الطبيعة، حديقة المنصورة للحيوانات هي وجهة مثالية لجميع أفراد العائلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //351
            ["id" => "3e19897b-2de3-4421-8428-b80481bbe9b6", "translation" => "The Chanderli cinema is an iconic destination for film enthusiasts. It provides an immersive cinematic experience in a warm and welcoming atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "84e3bcd8-107b-4640-8bce-5048fb5bbf61", "translation" => "Le cinéma Chanderli est un lieu emblématique pour les passionnés du septième art. Il offre une expérience cinématographique immersive dans une ambiance chaleureuse et accueillante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1165f6eb-8a51-4cbf-9d3d-1b0287073dfc", "translation" => "سينما شندرلي هي وجهة مميزة لعشاق الفن السابع. إنها تقدم تجربة سينمائية غامرة في جو مرحب.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //352
            ["id" => "4496dceb-7d81-45de-9356-317a811fcf22", "translation" => "Whether you're passionate about history, Islamic art, or simply curious to explore Tlemcen's rich heritage, the Islamic archaeology museum offers a unique opportunity to delve into the past and discover the treasures of this culturally and intellectually enriched region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "baab1cc0-19cb-40ee-9378-955b3c339355", "translation" => "Que vous soyez passionné d'histoire, d'art islamique ou simplement curieux de découvrir la riche héritage de Tlemcen, le musée d'archéologie islamique vous offre une occasion unique de plonger dans le passé et d'explorer les trésors de cette région empreinte de culture et de savoir.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "20f2551e-3e9e-4cdf-9972-8cfac05d4bf2", "translation" => "سواء كنت مهتمًا بالتاريخ أو فن العصور الإسلامية، أو مجرد فضول لاكتشاف تراث تلمسان الغني، يقدم لك متحف الآثار الإسلامية فرصة فريدة للغوص في الماضي واستكشاف كنوز هذه المنطقة الغنية بالثقافة والمعرفة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //353
            ["id" => "4f4027fb-46ea-4fe1-ab7d-8f1998f4da77", "translation" => "In addition to its religious significance, the great mosque is also an important cultural and historical symbol. It embodies the architectural heritage of the Zianid dynasty that left its mark on the region. Its preservation and maintenance reflect the community's commitment to its heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1f48e460-a7d9-4563-a71c-7325c5add272", "translation" => "En plus de son aspect religieux, la grande mosquée est également un symbole culturel et historique important. Elle incarne l'héritage architectural de la dynastie des Zianides qui a marqué la région. Sa préservation et son entretien témoignent de l'attachement de la communauté à son patrimoine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4a4cf0b2-3514-45d7-a056-df6b95015d5e", "translation" => "بالإضافة إلى أهميتها الدينية، يعتبر المسجد الكبير رمزًا ثقافيًا وتاريخيًا مهمًا. إنه يجسد التراث المعماري لسلالة الزيانيين التي كان لها تأثير كبير على المنطقة. الحفاظ عليها وصيانتها يعكسان التفاني المجتمعي في حفظ تراثه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //354
            ["id" => "cf092b3d-9a54-4e4c-b3ef-3451a38c0edb", "translation" => "A visit to the museum of art and history is a unique opportunity to delve into the region's history, appreciate its artistic heritage, and gain a better understanding of its rich past. Whether you're passionate about art, history, or simply curious to explore Tlemcen's culture, this museum is a must-visit for culture and history enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b5165f57-e6f1-41da-8a23-d850e7b1efc8", "translation" => "Une visite au musée d'art et d'histoire est une occasion unique de plonger dans l'histoire de la région, d'apprécier son héritage artistique et de mieux comprendre son riche passé. Que vous soyez passionné d'art, d'histoire ou simplement curieux de découvrir la culture de Tlemcen, ce musée est un incontournable pour les amateurs de culture et d'histoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "71f64dd2-c880-4237-9de6-0e066094e668", "translation" => "زيارة المتحف الوطني للفن و التاريخ هي فرصة فريدة للغوص في تاريخ المنطقة، وتقدير تراثها الفني، وفهم أفضل لماضيها الغني. سواء كنت مهتمًا بالفن أو التاريخ، أو مجرد فضول لاكتشاف ثقافة تلمسان، فإن هذا المتحف لا غنى عن زيارته لعشاق الثقافة والتاريخ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //355
            ["id" => "14674cd1-ad23-4907-b3e2-3d145cdac11c", "translation" => "The Emir Abdelkader square provides a picturesque setting where history and contemporary life harmoniously converge. Surrounded by both historical and modern buildings, this square is a lively and vibrant gathering place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "986d8262-352d-4f46-8016-525878bc0a95", "translation" => "La place de l'Emir Abdelkader offre un cadre pittoresque où l'histoire et la vie contemporaine se rencontrent harmonieusement. Entourée de bâtiments historiques et modernes, cette place est un lieu de rassemblement animé et vibrant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "328eddc9-4b17-4518-a9de-2003961b771e", "translation" => "ساحة الأمير عبد القادر توفر إطارًا جماليًا حيث تتلاقى التاريخ والحياة المعاصرة بانسجام. محاطة بالمباني التاريخية والحديثة على حد سواء، تعتبر هذه الساحة مكانًا للتجمع حيويًا ونابضًا بالحياة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //356
            ["id" => "869538c7-4756-4de9-a483-17bd0c2c942f", "translation" => "Whether it's a family day out, a gathering with friends, or just a chance to enjoy nature, the Lalla Setti amusement park is a must-visit destination for relaxation and entertainment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "087ff83e-07aa-47b6-8b94-9c5ef529218d", "translation" => "Que ce soit pour une journée en famille, une sortie entre amis ou simplement pour profiter de la nature, le parc de loisirs Lalla Setti est un lieu de détente et de divertissement incontournable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fb589d69-d58a-4c95-b1f7-505388073ece", "translation" => "سواء كانت لقضاء يوم مع العائلة، أو للخروج مع الأصدقاء، أو حتى مجرد الاستمتاع بالطبيعة، حديقة التسلية لالة ستي هي وجهة لا غنى عنها للاسترخاء والترفيه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //357
            ["id" => "52196135-5ff8-410d-a946-ff0137510aac", "translation" => "This museum serves as a place of memory and recognition for those who fought for Algeria's independence. It allows visitors to gain a better understanding of this significant period in the country's history and to pay tribute to the heroes of the revolution.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9323141e-c602-4a33-9593-2ed04fd48c81", "translation" => "Ce musée constitue un lieu de mémoire et de reconnaissance envers ceux qui se sont battus pour l'indépendance de l'Algérie. Il permet aux visiteurs de mieux comprendre cette période importante de l'histoire du pays et de rendre hommage aux héros de la révolution.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d61d3ad6-dead-4911-a98d-734683a2a27a", "translation" => "هذا المتحف يشكل مكانًا للذاكرة والاعتراف تجاه الذين قاتلوا من أجل استقلال الجزائر. إنه يتيح للزوار فهمًا أفضل لهذه الفترة المهمة في تاريخ البلاد وتكريم أبطال الثورة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //358
            ["id" => "81b87a4f-6bf5-402d-926f-73aea2140e5a", "translation" => "The tomb of Lalla Setti is a place of spirituality and devotion, where visitors can find a sense of peace and connection with the saint.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c74a1077-ee8c-42e8-8576-1caefc9967cf", "translation" => "Le tombeau de Lalla Setti est un lieu de spiritualité et de dévotion, où les visiteurs peuvent trouver un sentiment de paix et de connexion avec la sainte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "78684dda-eb76-424f-abe8-53afd1c19448", "translation" => "يعتبر ضريح لالة ستي مكانا للروحانية والتفاني، حيث يمكن للزوار أن يجدوا شعورا بالسلام والاحترام تجاه هذه الشخصية التاريخية في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //359
            ["id" => "46f0c3bb-a761-4e81-9626-6ab63285b6d4", "translation" => "The Beni Add caves offer a captivating experience of nature and history. With their impressive rock formations and mystical ambiance, they represent a true natural and cultural treasure to explore.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e28c0560-a726-4178-8c66-0d338f58fb8a", "translation" => "Les grottes de Beni Add offrent une expérience captivante de la nature et de l'histoire. Avec leurs formations rocheuses impressionnantes et leur ambiance mystique, elles constituent un véritable trésor naturel et culturel à découvrir.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c52e29bf-2d5d-4b15-8a83-2d239a58b505", "translation" => "مغارات بني عاد تقدم تجربة مثيرة للطبيعة والتاريخ. مع تكويناتها الصخرية الرائعة وجوها الغامض، فهي تمثل كنزًا طبيعيًا وثقافيًا حقيقيًا يجب اكتشافه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //360
            ["id" => "b3e69c92-9635-45b1-9337-e14026022ebf", "translation" => "A peaceful place where nature and recreation come together. Whether for relaxation or to enjoy the sports facilities, this garden provides a space of comfort and entertainment for all visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8fb05bd6-0266-4234-936c-c68d325bb174", "translation" => "Un endroit paisible où la nature et les loisirs se rejoignent. Que ce soit pour se détendre ou profiter des installations sportives, ce jardin offre un espace de confort et de divertissement pour tous les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6be5d406-af40-4e8a-bced-86817164a09a", "translation" => "مكان هادئ أين تتلاقى الطبيعة والترفيه. سواء كنت تبحث عن الاسترخاء أو للاستمتاع بالمرافق الرياضية، يوفر هذا الحديقة مساحة للراحة والترفيه لجميع الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //361
            ["id" => "56a5c1f2-23ef-44fc-acda-ad233e2e4137", "translation" => "The Lalla Setti plateau is a captivating place where visitors can enjoy an exceptional panoramic view, relax in green spaces, or explore the local history and culture.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "95c6c345-9543-4eae-9ad8-4e5d54a06d4d", "translation" => "Le plateau de Lalla Setti est un lieu captivant où les visiteurs peuvent profiter d'une vue panoramique exceptionnelle, se détendre dans les espaces verdoyants ou découvrir l'histoire et la culture locales.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5bdaf061-43ed-42c3-b6ca-b93c7fb99142", "translation" => "هَضْبَة لالة ستي مكان مثير حيث يمكن للزوار الاستمتاع بمناظر بانورامية استثنائية، والاسترخاء في المساحات الخضراء، أو استكشاف التاريخ والثقافة المحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //362
            ["id" => "7e5d6f5e-9602-4488-8449-5521a69e4cec", "translation" => "The grand basin park provides an enchanting setting, blending history, green spaces, and modern facilities. It's an ideal place to relax, have fun, and enjoy moments of tranquility in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9fae9d3c-599d-4558-97c3-6175ebfcb0d2", "translation" => "Le parc du grand bassin offre un cadre enchanteur, mêlant histoire, espaces verts et installations modernes. C'est un lieu idéal pour se détendre, se divertir et profiter de moments de tranquillité au cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4d91fa17-4ab0-4f7b-98b9-a1c3d9fb0049", "translation" => "حديقة الحوض الكبير توفر إعدادًا ساحرًا، حيث يمتزج التاريخ والمساحات الخضراء والمرافق الحديثة. إنها مكان مثالي للاسترخاء، والترفيه، والاستمتاع بأوقات هادئة في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //363
            ["id" => "353ac8c1-0cb7-47d9-9991-63f0e81d77ca", "translation" => "It's an ideal place for nature lovers, hikers, and photography enthusiasts who will find inspiration and relaxation in the El Ourit waterfalls. Whether it's for a peaceful walk, a refreshing swim, or simply to relax while listening to the soothing sound of falling water.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "97ac181e-0bf0-461d-98a8-a51e55ecdb42", "translation" => "C'est un endroit idéal pour les amoureux de la nature, les randonneurs et les amateurs de photographie, qui trouveront dans les cascades d'El Ourit une source d'inspiration et de détente. Que ce soit pour une promenade paisible, une baignade rafraîchissante ou simplement pour se détendre en écoutant le bruit apaisant de l'eau qui tombe.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "193a302d-5138-4743-9121-5ad6def29bcb", "translation" => "إنه مكان مثالي لعشاق الطبيعة، والمتنزهين، وعشاق التصوير الذين سيجدون في شلالات الأوريت مصدر إلهام واسترخاء. سواء كان ذلك للقيام بنزهة هادئة، أو للاستحمام والانتعاش، أو ببساطة للاسترخاء أثناء الاستماع إلى صوت المياه المتساقطة المهدئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //364
            ["id" => "03d3f14d-4ed5-49b9-850b-9ae1ef6a439a", "translation" => "The Eiffel bridge is a true engineering masterpiece that impresses with its iconic structure and elegant design. Built in 1899 by the famous Gustave Eiffel's company, this metal bridge majestically spans the El Ourit river.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c7f39213-514f-4e4f-ae5c-5f15916d5c13", "translation" => "Le pont Eiffel est un véritable chef-d'œuvre d'ingénierie qui impressionne par sa structure emblématique et son design élégant. Construit en 1899 par la célèbre société de Gustave Eiffel, ce pont métallique traverse majestueusement la rivière d'El Ourit.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "12b72da3-4017-4b09-ba2a-7216c8541671", "translation" => "جسر إيفل هو تحفة هندسية حقيقية تبهر ببنيتها الرمزية وتصميمها الأنيق. تم بناؤه في عام 1899 من قبل شركة غوستاف إيفل الشهيرة، ويمتد هذا الجسر المعدني بكبرياء عبر نهر الأوريت.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //365
            ["id" => "87d67074-6efe-4cf4-8e5e-0a184080f931", "translation" => "The Boughrara park, bordering the Mouilah river, is a peaceful space offering an enchanting natural setting. This picturesque park is a popular spot for both residents and visitors seeking a place to relax and rejuvenate.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "08aa4ab5-96a6-49b3-a075-a9e2149bc42d", "translation" => "Le parc Boughrara bordant l'oued Mouilah, est un espace paisible offrant un cadre naturel enchanteur. Ce parc pittoresque est un lieu prisé par les habitants et les visiteurs qui cherchent un endroit pour se détendre et se ressourcer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5fd18722-eb5c-4a92-a1b6-b5a153682788", "translation" => "حديقة بوغرارة الممتدة على ضفاف نهر المويلح هي مكان هادئ يقدم إطارًا طبيعيًا ساحرًا. تعتبر هذه الحديقة الخلابة وجهة مفضلة للسكان المحليين والزوار الذين يبحثون عن مكان للاسترخاء والتجديد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //366
            ["id" => "fd296938-6478-4695-b758-8a8c0471089e", "translation" => "Whether you're a history enthusiast, a culture lover, or simply seeking a unique experience, the ruins of Taount in El Ghazaouet invite you to journey into the past and uncover the mysteries of this ancient city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a9022eae-9a32-46e5-ab98-6cdad724f213", "translation" => "Que vous soyez un passionné d'histoire, un amateur de culture ou simplement en quête d'une expérience unique, les ruines de Taount à el Ghazaouet vous invitent à faire un voyage dans le passé et à découvrir les mystères de cette ancienne cité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6a92af33-805d-4a0c-be59-2324dfaca368", "translation" => "سواء كنت مهتمًا بالتاريخ أو عاشقًا للثقافة، أو مجردًا بحثًا عن تجربة فريدة، تدعوك أطلال تاونت في الغزوات إلى السفر إلى الماضي واكتشاف أسرار هذه المدينة القديمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //367
            ["id" => "67ba7045-cd9f-4e52-a481-476d06375aa3", "translation" => "Pedestrians have the opportunity to admire the lighthouse from the surroundings, enjoying the breathtaking view of the sea and the coastal landscapes. It's an ideal spot for a peaceful stroll along the coast, to catch the sunset, or simply to relax while listening to the soothing sound of the waves.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e5f0426c-1be2-4f8c-92d5-a97baf322288", "translation" => "Les passants ont la possibilité d'admirer le phare depuis les environs, en profitant de la vue imprenable sur l'océan et les paysages côtiers. C'est un endroit idéal pour une promenade tranquille le long de la côte, pour profiter du coucher de soleil ou simplement pour se détendre en écoutant le bruit apaisant des vagues.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1402d525-a949-43ee-a289-da8cd53a7cbf", "translation" => "المارة لديهم الفرصة لمعاينة المنارة من المناطق المحيطة، مستمتعين بالإطلالة الرائعة على البحر والمناظر الساحلية. إنه مكان مثالي للنزهة الهادئة على طول الساحل، للاستمتاع بغروب الشمس، أو ببساطة للاسترخاء والاستماع إلى صوت الأمواج المهدئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //368
            ["id" => "c62e6ca2-fc8b-4101-a181-31f891e02e93", "translation" => "Whether it's to attend a captivating theatrical performance, admire exceptional works of art, or enjoy an enchanting musical evening, the Tlemcen palace of culture provides an unforgettable cultural experience for both residents and visitors of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2c7e2bf3-18f4-4bba-a85e-3c2e6526ed4d", "translation" => "Que ce soit pour assister à une représentation théâtrale captivante, admirer des œuvres d'art exceptionnelles ou profiter d'une soirée musicale envoûtante, le palais de la culture de Tlemcen offre une expérience culturelle inoubliable pour les habitants et les visiteurs de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "62231607-201f-4ba4-a7d5-ab56d74768d6", "translation" => "سواء كان لحضور عرض مسرحي مثير، أو لمعاينة أعمال فنية استثنائية، أو للاستمتاع بأمسية موسيقية ساحرة، يقدم قصر الثقافة في تلمسان تجربة ثقافية لا تُنسى للسكان والزوار على حد سواء في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //369
            ["id" => "46f36e99-049b-4e79-b55e-18032b3d1b94", "translation" => "The andalusian studies center is a fascinating place where one can delve into the history and beauty of Andalusia. It's a valuable place for the preservation and dissemination of this unique cultural heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "091e9193-35f8-4f81-9106-6b71008a8001", "translation" => "Le centre d'études andalouses est un lieu fascinant où l'on peut plonger dans l'histoire et la beauté de l'Andalousie. C'est un endroit précieux pour la préservation et la diffusion de cet héritage culturel unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8f46765c-00c3-4c56-8871-03d49cf7ef2b", "translation" => "مركز الدراسات الأندلسية هو مكان رائع حيث يمكن للزائرين الغوص في تاريخ وجمال الأندلس. إنه مكان قيم للحفاظ على نشر هذا التراث الثقافي الفريد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //370
            ["id" => "05f99cbd-33ee-4356-86cf-04923829591d", "translation" => "The ruins of Honaine are a captivating testimony to the history and evolution of this city. By exploring these ruins, visitors can envision the life and activities that once animated this flourishing city. It's a must-visit for enthusiasts of archaeology, history, and culture, offering a journey through time across the various epochs that have left their mark on the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "01580f95-e507-4120-94bd-dc3c7839f125", "translation" => "Les vestiges de Honaine sont un témoignage fascinant de l'histoire et de l'évolution de cette ville. En explorant ces ruines, les visiteurs peuvent imaginer la vie et les activités qui animaient autrefois cette cité florissante. C'est un lieu incontournable pour les passionnés d'archéologie, d'histoire et de culture, offrant un voyage dans le temps à travers les différentes époques qui ont marqué la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c4df3c64-2de2-4d96-a98e-5a2ba7765252", "translation" => "أثار هنين هي شاهد مذهل على تاريخ وتطور هذه المدينة. عند استكشاف هذه الأطلال، يمكن للزوار أن يتخيلوا الحياة والأنشطة التي كانت تنشط في هذه المدينة الازدهار في السابق. إنه مكان لا غنى عنه لهواة علم الآثار والتاريخ والثقافة، حيث يقدم رحلة عبر الزمن عبر العصور المختلفة التي شهدتها المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //371
            ["id" => "d2e59b2c-4c86-4945-a63a-caf79e4efc4b", "translation" => "El Hartoun garden is a beloved place for Tlemcen's residents and visitors alike, appreciated for its natural beauty and relaxing atmosphere. Whether it's for a peaceful stroll, a family picnic, or simply to enjoy the tranquility, this garden provides an outdoor recreational space where one can relax and reconnect with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e53f987c-edfc-40a3-a425-0a1d8127b4cc", "translation" => "Le jardin el Hartoun est un lieu apprécié par les habitants et les visiteurs de Tlemcen pour sa beauté naturelle et son atmosphère relaxante. Que ce soit pour une promenade tranquille, un pique-nique en famille ou simplement pour profiter du calme, ce jardin offre un espace de loisirs en plein air où l'on peut se détendre et se reconnecter avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f737dd6f-155b-4058-a217-f4362e2c5b44", "translation" => "حديقة الحرطون هي مكان محبب من قبل سكان تلمسان والزوار على حد سواء، حيث يُقدر لجمالها الطبيعي وأجوائها المريحة. سواء كان الأمر للنزهة الهادئة، أو للنزهة مع العائلة، أو ببساطة للاستمتاع بالهدوء، توفر هذه الحديقة مساحة ترفيهية في الهواء الطلق حيث يمكن للزائرين الاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //372
            ["id" => "2b8e5a01-5a11-43d5-9c24-b62720e41928", "translation" => "The Boumaaza cave offers a fascinating experience for nature enthusiasts and explorers. Its ecological significance and natural beauty make it a place of interest for visitors seeking adventures and spectacular landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d30c6597-e238-498f-9882-e8759ecb13a6", "translation" => "La grotte de Boumaaza offre une expérience fascinante aux amateurs de nature et de découverte. Son importance écologique et sa beauté naturelle en font un lieu d'intérêt pour les visiteurs en quête d'aventures et de paysages spectaculaires.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7ffd2ee7-a07c-4ca1-8a61-19431b5aca9c", "translation" => "غار بومعزة يقدم تجربة ساحرة لعشاق الطبيعة والمستكشفين. أهميته البيئية وجماله الطبيعي يجعلانه مكانًا مثيرًا للاهتمام بالنسبة للزوار الباحثين عن المغامرات والمناظر الرائعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //373
            ["id" => "752be419-a617-4913-ac49-bfe65477f135", "translation" => "Dayet el Ferd is primarily surrounded by agricultural activities, and its water is used for irrigation purposes. In the past, taxes were collected from caravans passing through the region, but today, the site hosts a weekly market that adds a cultural and economic dimension to the area. This activity is an ideal opportunity to combine ecotourism with scientific and cultural research.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "022bb650-5432-43e6-800a-48b80d3b63c6", "translation" => "Dayet El Ferd est principalement entouré d'activités agricoles et son eau est utilisée à des fins d'irrigation. Autrefois, des impôts étaient prélevés sur les caravanes qui traversaient la région, mais aujourd'hui, le site abrite un marché hebdomadaire qui ajoute une dimension culturelle et économique à la région. Cette activité est une opportunité idéale pour associer l'écotourisme avec la recherche scientifique et culturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1de94215-67f6-4fbc-9482-91e2aae7fc11", "translation" => "ضاية الفرد محاطة بنشاطات زراعية في المقام الأول، ويتم استخدام مياهها لأغراض الري. في الماضي، كان يتم فرض ضرائب على القوافل التي كانت تعبر عبر المنطقة، ولكن اليوم، يستضيف الموقع سوقًا أسبوعيًا يضيف بعدًا ثقافيًا واقتصاديًا إلى المنطقة. هذا النشاط هو فرصة مثالية لربط السياحة البيئية مع البحث العلمي والثقافي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //374
            ["id" => "44586b38-aa79-4c70-a873-c4032fa97e1d", "translation" => "Ksar el Kaïd is a symbol of Tlemcen's culture and history, attracting visitors eager to explore the heritage and traditional architecture of the region. The palace stands out with its magnificent design and unique architecture, offering a window to the past and telling an important story about the life and culture of that historical era.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7cdbf474-57c2-4855-84e4-d2bdca6817e5", "translation" => "Ksar el Kaïd est un symbole de la culture et de l'histoire de Tlemcen, attirant les visiteurs désireux d'explorer le patrimoine et l'architecture traditionnelle de la région. Le palais se distingue par son design magnifique et son architecture unique, offrant une fenêtre sur le passé et racontant une histoire importante sur la vie et la culture de cette époque historique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d1b4c618-f5f2-40c5-8932-d3c670d412d4", "translation" => "قصر القايد هو رمز لثقافة وتاريخ تلمسان، حيث يجذب الزوار الراغبين في استكشاف التراث والهندسة المعمارية التقليدية للمنطقة. يتميز القصر بتصميمه الرائع وبنيته الفريدة، مما يقدم نافذة إلى الماضي ويروي قصة هامة عن الحياة والثقافة في تلك الحقبة التاريخية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //375
            ["id" => "d160555e-e7cf-426a-84a8-e461a0ed96de", "translation" => "El Kef canyon is a true natural gem that provides breathtaking scenery and endless opportunities for hiking and camping.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a476c8a5-de75-4283-b6c3-fc25e236694b", "translation" => "Le canyon d'El Kef est un véritable joyau naturel qui offre un paysage époustouflant et des possibilités infinies pour la randonnée et le camping.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "88857539-8952-4e4d-be18-2a597aba8f13", "translation" => "كانيون الكاف هو جوهرة طبيعية حقيقية تقدم مناظر خلابة و فرص لا نهاية لرياضة المشي والتخييم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //376
            ["id" => "9ea968d6-f724-4a08-bbf6-e10eabbfac90", "translation" => "Whether you're a nature enthusiast, a photography enthusiast, or simply seeking a peaceful place to rejuvenate, El Karimia waterfall is a true natural treasure of the region waiting to be discovered.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cdb2e06c-6b51-4f5f-8737-694df5385675", "translation" => "Que vous soyez un amateur de nature, un passionné de photographie ou simplement en quête d'un endroit paisible pour vous ressourcer, la cascade d'El Karimia est un véritable trésor naturel de la région à découvrir.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d6278ec6-9afd-440c-8de3-c3871940b8cf", "translation" => "سواء كنت عاشقًا للطبيعة، أو هاويًا للتصوير الفوتوغرافي، أو ببساطة تبحث عن مكان هادئ لتجديد طاقتك، فإن شلال الكريمية كنز طبيعي حقيقي في المنطقة ينتظر الاكتشاف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //377
            ["id" => "a558c654-ae53-49d6-8c32-c6738fccf2dd", "translation" => "The regional theater of Bel Abbes is an iconic cultural venue that celebrates the performing arts and offers a rich artistic program.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "be98841b-c771-4c3f-80a8-ac3e28da8919", "translation" => "Le théâtre régional de Bel Abbès est un lieu culturel emblématique qui célèbre les arts de la scène et offre une riche programmation artistique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "540b1195-6536-41aa-a40c-179f018fc8e1", "translation" => "المسرح الجهوي لبلعباس هو مكان ثقافي رمزي يحتفل بفنون المسرح ويقدم برامج فنية غنية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //378
            ["id" => "4d5cbc89-5a64-404c-a29b-2feaa7651aff", "translation" => "It's a gathering place where the social and cultural life of the city is fully expressed.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7836d43c-1563-4fa0-a305-7fef1572210c", "translation" => "C'est un lieu de rassemblement où la vie sociale et culturelle de la ville s'exprime pleinement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "04fc86b3-680f-4b6d-adaf-2e72d054b14f", "translation" => "إنه مكان للتجمع حيث تعبّر الحياة الاجتماعية والثقافية للمدينة بكاملها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //379
            ["id" => "49546de7-f610-4aae-ac43-f6e9aae378cd", "translation" => "The Sidi Bel Abbes public garden is a pleasant place where one can enjoy nature, admire animals, and spend quality time outdoors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "715e3af9-5a6f-450d-9a97-78f81f649d6a", "translation" => "Le jardin public de Sidi Bel Abbès est un lieu agréable où l'on peut profiter de la nature, admirer les animaux et passer du temps de qualité en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b6d70386-2bf0-479f-98a9-62767be543a6", "translation" => "حديقة سيدي بلعباس العامة هي مكان لطيف حيث يمكن للزوار الاستمتاع بالطبيعة، ومشاهدة الحيوانات، وقضاء وقت جيد في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //380
            ["id" => "d2f94534-2cc5-4c60-b51a-d5fa54d79863", "translation" => "The cinematheque of Sidi Bel Abbes is a dynamic and inspiring place for cinema fans, providing a platform for the discovery, education, and appreciation of cinema.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a0446ebc-1eb3-4a06-9a03-fe2143c2b52f", "translation" => "La cinémathèque de Sidi Bel Abbès est un lieu dynamique et inspirant pour les cinéphiles, offrant une plateforme pour la découverte, l'éducation et l'appréciation du cinéma.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f8b41fbb-51a3-4503-9030-b110bb512b03", "translation" => "سينماتيك سيدي بلعباس هو مكان دينامي وملهم لعشاق السينما، يقدم منصة لاكتشاف السينما والتعليم والتقدير.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //381
            ["id" => "91254bc0-0e35-4bce-9b20-e3908c446486", "translation" => "El Amarna cinema is an entertainment and cultural venue that contributes to the cinematic vibrancy of Sidi Bel Abbes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a6181106-592f-49bf-8b02-c14c1993f6f3", "translation" => "Le cinéma el Amarna est un lieu de divertissement et de culture qui contribue à la dynamique cinématographique de Sidi Bel Abbès.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "da321086-e33f-4bda-8d4c-37c7186062bd", "translation" => "سينما العمارنة هي مكان ترفيهي وثقافي يسهم في النشاط السينمائي في سيدي بلعباس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //382
            ["id" => "9d716eda-eb10-49fb-b7ae-56134f22e7e0", "translation" => "The Tessala cinema is a popular entertainment venue where the residents of Sidi Bel Abbes can gather and share their passion for cinema. Whether with family or friends, the cinema provides a pleasant and entertaining escape from daily life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b1478cc7-5c3e-4a6e-91ff-4e10670bd009", "translation" => "Le cinéma Tessala est un lieu de divertissement populaire où les habitants de Sidi Bel Abbès peuvent se retrouver et partager leur passion pour le cinéma. Que ce soit en famille ou entre amis, le cinéma offre une escapade agréable et divertissante du quotidien.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8cf381ec-fd1b-4102-aa30-b61e13b886bb", "translation" => "سينما تسالة مكان ترفيهي شهير حيث يمكن لسكان سيدى بلعباس الاجتماع ومشاركة شغفهم بالسينما. سواء كانوا مع العائلة أو الأصدقاء، تقدم السينما فرصة للهروب الممتعة والمسلية من الحياة اليومية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //383
            ["id" => "6bd0da56-086f-4e64-ac1f-8cded98a0583", "translation" => "The dome is a must-visit for shoppers and those looking to experience the daily life of the city. It's a dynamic and lively market that showcases the richness and diversity of Sidi Bel Abbes' commercial offerings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e59647f8-3d7b-4b5b-878f-26cf48d06ca0", "translation" => "La coupole est un lieu incontournable pour les amateurs de shopping et pour ceux qui souhaitent découvrir la vie quotidienne de la ville. C'est un marché dynamique et vivant qui témoigne de la richesse et de la diversité de l'offre commerciale de Sidi Bel Abbès.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0848ab77-5415-4c61-81e7-5264b72b73f1", "translation" => "القبة هو مكان لا غنى عنه لعشاق التسوق ولأولئك الذين يرغبون في اكتشاف حياة المدينة اليومية. إنه سوق نشط وحيوي يُظهر ثراء وتنوع العروض التجارية في سيدي بلعباس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //384
            ["id" => "496a1a9d-8869-462f-892e-36c241b940e2", "translation" => "Thanks to its privileged geographical location, the Sidi Mohamed Benali lake is a true natural treasure that deserves to be discovered and preserved. It embodies the beauty and diversity of the landscapes of western Algeria, offering visitors an unforgettable experience in the heart of pristine nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a52fadf8-3090-4f4c-a017-f1930fefc8c6", "translation" => "Grâce à sa situation géographique privilégiée, le lac de Sidi Mohamed Benali est un véritable trésor naturel qui mérite d'être découvert et préservé. Il incarne la beauté et la diversité des paysages de l'Ouest algérien, offrant aux visiteurs une expérience inoubliable au cœur d'une nature préservée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e1d160e7-d388-4b55-bdd9-9c54aa1403de", "translation" => "بفضل موقعه الجغرافي المتميز، يعد بحيرة سيدي محمد بن علي كنزًا طبيعيًا حقيقيًا يستحق الاكتشاف والحفاظ عليه. إنه يجسد جمال وتنوع المناظر الطبيعية في غرب الجزائر، مما يقدم للزوار تجربة لا تُنسى في قلب الطبيعة النقية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //385
            ["id" => "990fcaa4-d150-4a2e-9682-b54ab4b97cac", "translation" => "The Perrin castle is a fascinating testament to the city's colonial past. Although it lies in ruins, it remains a tourist attraction that draws the curious and history enthusiasts. Visitors can appreciate its architecture and atmosphere, despite its gradual decline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "79f7b916-0def-48a2-adc9-562c7c44d3cf", "translation" => "Le château Perrin est un témoignage fascinant du passé colonial de la ville. Bien qu'il soit en ruine, il reste une attraction touristique qui attire les curieux et les amateurs d'histoire. Les visiteurs peuvent apprécier son architecture et son ambiance, malgré son déclin progressif.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bd075ea1-def8-48b6-961d-26843326cf72", "translation" => "قصر بيران هو شاهد رائع على الماضي الاستعماري للمدينة. على الرغم من أنه اليوم في حالة خراب، إلا أنه لا يزال معلمًا سياحيًا يجذب عشاق التاريخ. يمكن للزوار التمتع بعمارته وجوهره، على الرغم من تدهوره التدريجي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //386
            ["id" => "76677c97-35be-4d42-98d4-1b21e83c8e43", "translation" => "The museum of the Moudjahid is an iconic place that pays tribute to the heroes of the war of independence. By visiting this museum, visitors gain a better understanding of Algeria's history and the struggle for freedom, while honoring those who sacrificed for the country's independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "eed59b61-e34d-41b5-a1e9-3377b0c1558a", "translation" => "Le musée du Moudjahid est un lieu emblématique qui rend hommage aux héros de la guerre d'indépendance. En visitant ce musée, les visiteurs auront une meilleure compréhension de l'histoire de l'Algérie et de la lutte pour la liberté, tout en honorant ceux qui se sont sacrifiés pour l'indépendance du pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0f76e677-cf76-401d-925f-d770672235e0", "translation" => "متحف المجاهد هو مكان رمزي يكرم أبطال حرب الاستقلال. من خلال زيارة هذا المتحف، يحصل الزوار على فهم أفضل لتاريخ الجزائر والنضال من أجل الحرية، مع تكريم الذين قدموا تضحيات من أجل استقلال البلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //387
            ["id" => "e2864505-ae24-4688-89f9-4c5caa38a51b", "translation" => "The gazelles castle, while not accessible to the public, is an imposing building that garners admiration for its architectural beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "15348577-79d8-43d8-98a0-75a6b29e29b2", "translation" => "Le Château des Gazelles, bien qu'il ne soit pas accessible au public, est un imposant bâtiment qui suscite l'admiration par sa beauté architecturale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2ec0e8a4-286a-4536-a46a-725ad1412af6", "translation" => "قصر الغزال، على الرغم من عدم إمكانية دخوله من قبل الجمهور، إلا أنه مبنى مهيب يستحق التقدير بجماله المعماري.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //388
            ["id" => "443bd9b0-7279-4959-bd30-3172837de788", "translation" => "The majestic Vilumbrales castle, although inaccessible to visitors, remains an imposing symbol of the city's history and architecture. This castle continues to inspire awe with its grandeur and beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7902d55b-84cd-4e73-b535-d58f9804f04b", "translation" => "Le majestueux château Vilumbrales, demeure un symbole imposant de l'histoire et de l'architecture de la ville malgré le fait qu’il soit inaccessible aux visiteurs. Ce château suscite toujours l'émerveillement par sa grandeur et sa beauté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "efc03052-ab7e-4a4c-90b6-3ab3cdf01f13", "translation" => "قصر فيلومبراليس الفخم، على الرغم من عدم إمكانية دخوله من قبل الزوار، يظل رمزًا لتاريخ المدينة وهندستها. هذا القصر ما زال يثير الدهشة بفخامته وجماله.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //389
            ["id" => "abb24b71-893a-4d37-96d7-0b6519bfa680", "translation" => "The Dietrich castle stands out with its majestic and imposing exterior that evokes a harmonious blend of architectural styles, attracting the curious and architecture enthusiasts who appreciate its charm and history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "be1703d2-05fc-4c1a-946c-d93bb86b68c5", "translation" => "Le château de Dietrich se distingue par son extérieur majestueux et imposant qui évoque un mélange harmonieux de styles architecturaux, attirant les curieux et les amateurs d'architecture qui apprécient son charme et son histoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bfd9b83d-df49-4d01-b96b-c8c1ec7658e1", "translation" => "يتميز قصر ديتريش بخارجه الفخم الذي يثير مزيجًا متناغمًا من الأنماط المعمارية، ما يجذب الفضوليين وعشاق العمارة الذين يقدرون سحره وتاريخه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //390
            ["id" => "c8da60d5-4924-4ed9-847a-d993d0df924b", "translation" => "Today transformed into a school of fine arts, the Napoleon castle remains a true architectural gem, bearing witness to the elegance and refinement of the era.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d21ae8ee-6604-4e2c-9ff1-c929e8df5008", "translation" => "Aujourd’hui transformé en école des beaux-arts, le château Napoléon reste un véritable bijou architectural, témoignant de l'élégance et du raffinement de l'époque.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8afa0d14-2b59-420d-b3ee-0f31b70ac493", "translation" => "بعد تحويله إلى مدرسة للفنون الجميلة، يظل قصر نابليون جوهرة معمارية حقيقية، تشهد على أناقة ورقي تلك الفترة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //391
            ["id" => "df98f2a2-5847-43a6-9443-bb82b090f594", "translation" => "The Sidi Bel Abbes house of culture is a modern and vibrant space that celebrates and promotes the cultural richness of the region. It provides a gathering place for art enthusiasts and serves as an essential platform for artistic creativity and dissemination.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bebff725-ba50-4ff1-8077-e4a9003f99e5", "translation" => "La maison de la culture de Sidi Bel Abbès est un espace moderne et animé qui valorise et promeut la richesse culturelle de la région. Elle offre un lieu de rassemblement pour les amateurs d'art et constitue une plateforme essentielle pour la créativité et la diffusion artistique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e84c89fe-32fb-4fa9-bf6d-8507122da761", "translation" => "دار الثقافة سيدي بلعباس مساحة حديثة وحية تحتفي وتروج للثراء الثقافي في المنطقة. إنها توفر مكانًا لاجتماع عشاق الفن وتعتبر منصة أساسية للإبداع والترويج الفني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //392
            ["id" => "0e7dd7a3-a8a2-4af6-9a8d-fda678ee0a1f", "translation" => "The Wiam square is a dynamic and welcoming place, energized by the locals and visitors alike. It's a hub of social life and conviviality, where one can enjoy the urban atmosphere while resting or having fun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ea07769a-40fb-4e28-8797-88a1d4c394cd", "translation" => "La place Wiam est un endroit dynamique et accueillant, animé par l'énergie des habitants et des visiteurs. C'est un lieu de vie sociale et de convivialité, où l'on peut profiter de l'ambiance urbaine tout en se reposant ou en se divertissant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "70becdd2-206d-44be-9ab5-a74f07a0370b", "translation" => "ساحة الوئام هي مكان دينامي ومرحب، مركز للحياة الاجتماعية والتواصل، حيث يمكن للأشخاص الاستمتاع بالجو الحضري بينما يستريحون أو يستمتعون بأوقاتهم بالترفيه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //393
            ["id" => "a178f297-c7e8-44fb-992f-802dd1af0c5b", "translation" => "The town hall of Sidi Bel Abbes is an iconic place that reflects the significance and dynamism of the city's municipal life. It serves as a workplace for municipal officials and a point of interest for visitors curious about the history and architecture of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f90bf478-a4f6-40de-a4f7-999cf9b7526c", "translation" => "L'hôtel de ville de Sidi Bel Abbès est un lieu emblématique qui reflète l'importance et le dynamisme de la vie municipale de la ville. Il est à la fois un lieu de travail pour les fonctionnaires municipaux et un lieu d'intérêt pour les visiteurs curieux de découvrir l'histoire et l'architecture de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ebd8472d-6a6a-4e6c-96d1-6b7bd811b06d", "translation" => "بلدية سيدي بلعباس هي مكان رمزي يعكس أهمية وحيوية الحياة البلدية في المدينة. إنها في الوقت نفسه مكان عمل للمسؤولين البلديين ونقطة اهتمام للزوار الفضوليين الذين يرغبون في اكتشاف تاريخ المنطقة وهندستها المعمارية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //394
            ["id" => "ddcd2b67-9b46-4294-beb2-515640d0e7b1", "translation" => "The Abu Bakr Essedik mosque is an iconic place of worship in the city. In the past, this mosque had a unique history as it was previously used as a church.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "99a7be82-68b7-47f7-bef2-5fac3e2d7a91", "translation" => "La mosquée Abou Bakr Essedik est un lieu de culte emblématique de la ville. Autrefois, cette mosquée avait une histoire particulière, car elle était auparavant utilisée comme église.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f1bcb7a3-2330-4837-976b-8d47d48b68ea", "translation" => "مسجد أبو بكر الصديق هو مكان عبادة رمزي في المدينة. في الماضي، كان لهذا المسجد تاريخ خاص حيث كان يُستخدم سابقًا ككنيسة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //395
            ["id" => "3dba73fc-53f1-448c-ad8e-61c33d013a00", "translation" => "The agricultural museum is a fascinating place that highlights the significance of agriculture in the region. It houses a diverse collection of objects, tools, and agricultural equipment used throughout different eras.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "032bde6a-613a-4d85-961e-a65d58a4de8d", "translation" => "Le musée d'agriculture est un lieu fascinant qui met en valeur l'importance de l'agriculture dans la région. Il abrite une collection variée d'objets, d'outils et d'équipements agricoles utilisés à travers les différentes époques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b145f7b2-b52c-482f-b397-85057efed964", "translation" => "المتحف الزراعي هو مكان رائع يسلط الضوء على أهمية الزراعة في المنطقة. يضم مجموعة متنوعة من الأشياء والأدوات ومعدات الزراعة المستخدمة عبر العصور المختلفة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //396
            ["id" => "69f6733f-6b24-4cf9-875b-a902ff6457ca", "translation" => "In this place, you will discover the history and diversity of puppets from around the world, and you will appreciate the work and passion of Mr. Kada Bensmicha in preserving this ancient art. It is an enriching experience for art enthusiasts, the curious, and visitors of all ages.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "85c43b13-ecab-4fa1-b826-9532839f47e8", "translation" => "Vous découvrirez en ce lieu, l'histoire et la diversité des marionnettes à travers le monde, et vous apprécierez le travail et la passion de Mr Kada Bensmicha pour préserver cet art ancien. C'est une expérience enrichissante pour les amateurs d'art, les curieux et les visiteurs de tous âges.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "49c3a97e-23c5-4a8b-93ec-184c4b27e373", "translation" => "في هذا المكان، ستكتشف تاريخ وتنوع العرائس من جميع أنحاء العالم، وستقدر العمل والشغف الذي يبذله السيد قادة بن شميسة للحفاظ على هذا الفن القديم. إنها تجربة مثرية لعشاق الفن، والفضوليين، والزوار من جميع الأعمار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //397
            ["id" => "33e36902-34b3-4384-8028-cc953c66a4c5", "translation" => "The Macta garden is an unconventional green space that extends over a considerable length. This linear garden provides a peaceful and pleasant setting for walking and relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "42ff11ef-4e92-4403-9e7e-6be100a66d4a", "translation" => "Le jardin de la Macta est un espace vert atypique qui s'étend sur une longueur considérable. Ce jardin linéaire offre un cadre paisible et agréable pour se promener et se détendre.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "af7db014-1f7d-45e5-b996-496014761c04", "translation" => "حديقة المقطع هي مساحة خضراء غير تقليدية تمتد على طول مسافة كبيرة. توفر هذه الحديقة الخطية إطارًا هادئًا وممتعًا للمشي والاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //398
            ["id" => "2ecf5495-589b-44e2-bb74-18f4674a337f", "translation" => "Whether for a relaxing stroll or a contemplative pause, the Macta 2 provides an ideal setting to rejuvenate and enjoy a peaceful moment with a beautiful panoramic view.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "44f16113-fb81-4a20-915b-a111da5508b6", "translation" => "Que ce soit pour une balade relaxante ou une pause contemplative, la Macta 2 offre un cadre idéal pour se ressourcer et profiter d'un moment de calme et d’un beau panorama.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "243e2056-1ae4-4b28-a494-080024fe8fcd", "translation" => "سواء كنت تبحث عن نزهة مريحة أو لحظة تأملية، فإن المقطع 2 توفر إعدادًا مثاليًا لاستعادة النشاط والاستمتاع بلحظة هدوء وإطلالة جميلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //399
            ["id" => "841f4dbd-b649-442b-a74c-a7a535c07ed5", "translation" => "The museum of the Mujahid is a must-visit place for those who wish to deepen their knowledge of Algeria's history and pay tribute to the heroes of the liberation war.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2124b251-8de3-4346-9d24-ccdc2d41a9be", "translation" => "Le musée du moudjahid est un lieu incontournable pour tous ceux qui souhaitent approfondir leur connaissance de l'histoire de l'Algérie et rendre hommage aux héros de la guerre de libération.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "92281b85-547e-46a1-b236-48a9a6771b92", "translation" => "متحف المجاهد هو مكان لا غنى عنه لكل من يرغب في تعميق معرفته بتاريخ الجزائر وتقديم الاحترام لأبطال حرب التحرير.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //400
            ["id" => "037cde52-e79a-4388-aacf-3104e217f412", "translation" => "The Mascara amusement park is a popular destination for the local residents and also attracts visitors from outside the region. It is a beloved recreational venue that adds to the liveliness and appeal of the city of Mascara.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c24867a7-da62-47ef-979d-b11d2c1c121d", "translation" => "Le parc d'attractions de Mascara est une destination prisée pour les habitants de la région et attire également des visiteurs venus de l'extérieur. C'est un lieu de loisirs apprécié qui contribue à l'animation et à l'attrait de la ville de Mascara.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "69bcf869-214a-484f-9e43-5c7aabe6f88c", "translation" => "حديقة التسلية معسكر وجهة محببة لسكان المنطقة ويجذب أيضًا زوارًا من خارج الإقليم. إنه مكان ترفيهي محبوب يسهم في إضفاء الحيوية وجاذبية مدينة معسكر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //401
            ["id" => "c12a96a2-a4a3-4fae-8f69-0ea429fa4a12", "translation" => "Due to the limited screenings, it is recommended for moviegoers to inquire in advance about the showtimes and films scheduled at the Essaada cinema. Despite this uniqueness, the cinema remains a cherished cultural venue in the city of Mascara, providing visitors with an opportunity to immerse themselves in the art of cinema within a historical and welcoming setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5e9938be-85a9-4482-a058-5e315dff3895", "translation" => "En raison de la rareté des projections, il est recommandé aux cinéphiles de se renseigner au préalable sur les horaires et les films programmés au cinéma Essaada. Malgré cette particularité, le cinéma reste un lieu culturel apprécié dans la ville de Mascara, offrant aux visiteurs une opportunité de plonger dans l'art du cinéma dans un cadre historique et chaleureux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dbea66b9-57d4-4f59-af04-0618fb2939c3", "translation" => "نظرًا لندرة العروض السينمائية، يُفضل لعشاق السينما الاستفسار مسبقًا عن أوقات العروض والأفلام المقررة في سينما السعادة. على الرغم من هذه الخصوصية، تظل السينما مكانًا ثقافيًا محببًا في مدينة معسكر، حيث توفر للزوار فرصة للانغماس في فن السينما في إطار تاريخي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //402
            ["id" => "671ae9cf-c466-4985-b0c7-93468335928e", "translation" => "This gallery serves as a showcase and marketplace for the traditional crafts of local artisans and as an exhibition space for the cultural heritage of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "325e1e68-c336-4374-85ce-8d28284e72b9", "translation" => "Cette galerie fait office d’espace de présentation et de commercialisation des produits de l'artisanat traditionnel des artisans et d’exposition du patrimoine culturel de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7865b0b1-29ba-439c-b141-5aeac8ca25d9", "translation" => "يعد هذا المعرض كمساحة لعرض وتسويق منتجات الحرف التقليدية للحرفيين المحليين وكمساحة عرض للتراث الثقافي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //403
            ["id" => "b29dd9ef-4d62-48db-9f86-8f29f887de27", "translation" => "Thanks to its central role in the cultural life of Mascara, the house of culture is a must-visit place for those who wish to explore and appreciate the artistic and cultural richness of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "191f3684-4dda-4c71-b335-e3f6d976d343", "translation" => "Grâce à son rôle central dans la vie culturelle de Mascara, la maison de la culture est un lieu incontournable pour ceux qui souhaitent explorer et apprécier la richesse artistique et culturelle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e046bb9b-3546-452c-ade2-a7f2d0e951e6", "translation" => "بفضل دورها المركزي في الحياة الثقافية لمعسكر، تعتبر دار الثقافة مكانًا لا غنى عنه لأولئك الذين يرغبون في استكشاف وتقدير الثراء الفني والثقافي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //404
            ["id" => "8a6215ed-1899-4ef1-804b-402fa323fab3", "translation" => "The craft house is an iconic place dedicated to the preservation and promotion of traditional craftsmanship in the region. Located in the heart of the city, this institution celebrates ancestral craftsmanship and provides visitors with an authentic glimpse of local craftsmanship.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6dfe9246-55a8-4479-b904-c6e87c8d8f4b", "translation" => "La maison de l'artisanat est un lieu emblématique dédié à la préservation et à la promotion des métiers artisanaux traditionnels de la région. Située au cœur de la ville, cette institution valorise le savoir-faire ancestral et offre aux visiteurs un aperçu authentique de l'artisanat local.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8719e6d4-9707-48d2-a948-8a098b286388", "translation" => "دار الصناعة التقليدية هي مكان بارز مكرس للحفاظ على وتعزيز الحرف التقليدية في المنطقة. تقع في قلب المدينة، تحتفل هذه المؤسسة بالحرفية وتقدم للزوار نظرة أصيلة على الحرف المحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //405
            ["id" => "81b42289-e1ca-4ab3-8bfc-08fa60e4ac51", "translation" => "Whether for a leisurely stroll, a sporting activity, or simply to relax amidst nature, the Tivariti park provides a pleasant and soothing environment for all who visit it.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2d11176f-5836-40da-9c99-39e32327d9e8", "translation" => "Que ce soit pour une promenade tranquille, une activité sportive ou simplement pour se détendre au milieu de la nature, le parc Tivariti offre un environnement agréable et apaisant à tous ceux qui le visitent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "600be506-43bf-48e2-b5cb-f74cadfb2a9f", "translation" => "سواء كنت تبحث عن نزهة هادئة، أو نشاط رياضي، أو ببساطة للاسترخاء في وسط الطبيعة، تقدم حديقة تيفاريتي بيئة ممتعة ومريحة لجميع الذين يزورونها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //406
            ["id" => "a8fa16e5-01fd-4fc6-b59e-c0b1a1fd196d", "translation" => "The Emir Abdelkader's smala is a place rich in history and symbolism, attracting visitors with its authenticity and its connection to Algeria's past.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7fb6f73f-50fc-4cd0-bac8-218ddce392d0", "translation" => "La smala de l'Emir Abdelkader est un lieu chargé d'histoire et de symboles, attirant les visiteurs par son caractère authentique et son lien avec le passé de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e8f733bc-9611-455b-926d-fe5b6cf40f3c", "translation" => "أزمالة الأمير عبد القادر مكان غني بالتاريخ والرموز، تجذب الزوار بأصالتها وصلتها بماضي الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //407
            ["id" => "e7cf80a7-c8cf-4d82-8dd6-b2c6573b4e17", "translation" => "The commemorative site of the allegiance to Emir Abdelkader is a place of great historical significance. This memorable event, which took place on November 27, 1832, marks a fundamental milestone in the foundation of modern Algeria.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "16e5f3ab-bd81-49ee-b04b-8d1fa5e22e0e", "translation" => "Le site commémoratif de l'allégeance de l'Emir Abdelkader est un lieu chargé d'importance historique. Cet événement mémorable, qui s'est déroulé le 27 novembre 1832, marque une étape fondamentale dans la fondation de l'État algérien moderne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "db9d13ec-fd18-4d39-9d91-f46d5081622b", "translation" => "الموقع التذكاري لمبايعة الأمير عبد القادر هو مكان ذو أهمية تاريخية كبيرة. هذا الحدث المذهل، الذي وقع في 27 نوفمبر 1832، يمثل مرحلة أساسية في تأسيس الجزائر الحديثة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //408
            ["id" => "ef480fc2-8d0e-4a90-81c1-adf4aee72209", "translation" => "El Moubayaa mosque has a rich and eventful history. Due to its significance in the resistance, Emir Abdelkader chose this mosque as the location for the second public allegiance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "58c596b0-3b13-4c2c-bdc8-27d3bdf620e0", "translation" => "La mosquée el Moubayaa a une histoire riche et mouvementée. En raison de son importance dans la résistance, l'émir Abdelkader a choisi cette mosquée comme lieu de la deuxième allégeance publique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4a88bc65-5f29-4fa6-8358-7995eaea4e4c", "translation" => "مسجد المبايعة لديه تاريخ غني ومليء بالأحداث. نظرًا لأهميته في المقاومة، اختار الأمير عبد القادر هذا المسجد كموقع للمبايعة العامة الثانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //409
            ["id" => "7865f86c-aafb-489f-b505-db3fbf55c394", "translation" => "This thermal resort is renowned in Algeria for its thermal waters. Its origin dates back to ancient Roman times, making it a place rich in history. The waters of the thermal resort are known for their healing and relaxing properties, attracting many visitors seeking wellness and thermal treatments.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1b132f6a-1085-46e1-86f1-bd031e6d163c", "translation" => "Cette station thermale est renommée en Algérie pour ses eaux thermales. Son origine remonte à l'Antiquité romaine, ce qui en fait un lieu chargé d'histoire. Les eaux de la station thermale sont réputées pour leurs propriétés curatives et relaxantes, attirant ainsi de nombreux visiteurs en quête de bien-être et de soins thermaux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6920cb36-c8a2-4e0e-b3e0-c70cab7a5c8c", "translation" => "هذا المنتجع مشهور في الجزائر بفضل مياهه الحرارية. يعود أصله إلى العصور الرومانية القديمة، مما يجعله مكانًا غنيًا بالتاريخ. مياه المنتجع مشهورة بخصائصها العلاجية والمريحة، مما يجذب العديد من الزوار الذين يبحثون عن الرفاهية والعلاجات الحرارية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //410
            ["id" => "82701443-f109-4dfa-a15c-3d7328c2aa4e", "translation" => "The garden is a beautiful green space that provides a peaceful and relaxing environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d182004e-8d2a-4ad2-8181-9dd2e806b23d", "translation" => "Le jardin est un magnifique espace verdoyant qui offre un environnement paisible et relaxant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ad724f8a-e34f-4ad2-9af6-fabd5b1f75b5", "translation" => "مساحة خضراء جميلة توفر بيئة هادئة ومريحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //411
            ["id" => "3cd536c5-6277-4df8-ae44-26ac140bc1dd", "translation" => "The square is carefully landscaped and provides a welcoming space for residents and visitors. At the center of the square, there is an imposing statue of Emir Abdelkader, paying tribute to his role in the struggle against colonial occupation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c9d8a7ca-02c0-429b-bbe8-a74ae3752dc4", "translation" => "La place est aménagée avec soin et offre un espace accueillant pour les habitants et les visiteurs. Au centre de la place, on trouve une statue imposante de l'Emir Abdelkader, rendant hommage à son rôle dans la lutte contre l'occupation coloniale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9dce692b-c871-453e-afe4-1b936abc2cdb", "translation" => "الساحة مُهيأة بعناية وتوفر مساحة ترحيبية للسكان والزوار. في وسط الساحة، هناك تمثال ضخم للأمير عبد القادر، يُكرّم دوره في مكافحة الاحتلال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //412
            ["id" => "da0ac06f-01bd-4d88-8377-0e88c327c4cb", "translation" => "El Yasmine garden is a green space that provides a breath of fresh air for lovers of Ramadan evenings and creates a pleasant atmosphere through cultural and artistic programs organized by the departments of culture, youth, and sports.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e21d6b4f-c0f1-4d34-b817-c63b1ac36415", "translation" => "Le jardin el Yasmine est un espace vert qui offre une bouffée d'oxygène aux amoureux des veillées ramadanesques et crée une ambiance agréable grâce à des programmes culturels et artistiques organisés par les directions de la culture et de la jeunesse et des sports.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8abcb2dd-a39f-428d-b182-7dc74649a224", "translation" => "حديقة الياسمين هي مساحة خضراء تقدم نسمة هواء نقية لعشاق ليالي رمضان وتخلق جوًا ممتعًا من خلال برامج ثقافية وفنية تنظمها إدارات الثقافة والشباب والرياضة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //413
            ["id" => "16875991-7aa6-4b84-bac2-9a43d5ce5545", "translation" => "The ruins of Ksar el Kaoua in Relizane are an archaeological site of historical significance. The ruins include partially preserved stone walls, building foundations, and other structures that provide insight into the architecture and daily life of the time. Despite signs of wear and deterioration, the ruins still exude a fascinating and intriguing atmosphere for visitors interested in history and archaeology.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f34f35ab-2aa3-4575-b3fb-19b32290d0e4", "translation" => "Les ruines de Ksar El Kaoua à Relizane sont un site archéologique d'importance historique. Les ruines comprennent des murs en pierre partiellement conservés, des fondations de bâtiments et d'autres structures qui offrent un aperçu de l'architecture et de la vie quotidienne de l'époque. Malgré les signes d'usure et de dégradation, les ruines dégagent encore une atmosphère fascinante et intrigante pour les visiteurs intéressés par l'histoire et l'archéologie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8ccbd2c8-3258-4083-9acd-851c5c624dc0", "translation" => "أطلال قصر القوة في غليزان موقع أثري ذو أهمية تاريخية. تشمل الأطلال جدرانًا حجرية محتفظة جزئيًا، وأسس مبانٍ، وهياكل أخرى توفر رؤية حول الهندسة المعمارية والحياة اليومية في ذلك الوقت. على الرغم من ظهور علامات الاهتراء والتدهور، إلا أن الأطلال لا تزال تنبعث منها أجواءً مثيرة ومثيرة للاهتمام بالنسبة للزوار المهتمين بالتاريخ والآثار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //414
            ["id" => "761b8da3-fc14-4c5f-a9eb-4a609ce6bdb0", "translation" => "The bridges of Zemmoura represent a historical and architectural heritage, offering a valuable insight into the Ottoman expertise in building sustainable infrastructure.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ef6dba66-199d-4fa8-8b1f-6f5976a4da05", "translation" => "Les ponts de Zemmoura représentent un héritage historique et architectural, offrant un aperçu précieux du savoir-faire des Ottomans en matière de construction d'infrastructures durables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ed137086-972a-4cb7-a029-738d8656d46d", "translation" => "جسور زمورة تمثل تراثًا تاريخيًا وهندسيًا، مما يوفر رؤية قيمة لخبرة العثمانيين في بناء البنية التحتية المستدامة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //415
            ["id" => "3a1ffa63-1101-4b60-80fd-c660daa94b37", "translation" => "El Merdja amusement park is an entertaining and enchanting place that offers a variety of activities for visitors. This park includes not only rides and attractions for all ages but also houses a collection of animals that add a unique dimension to the experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cbac9ba8-b4f9-40d5-9c41-f147300ed919", "translation" => "Le parc d'attractions d'el Merdja est un lieu divertissant et enchanteur qui offre une variété d'activités pour les visiteurs. Ce parc comprend non seulement des manèges et des attractions pour tous les âges, mais il abrite également une collection d'animaux qui ajoutent une dimension unique à l'expérience.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9b1a563c-517b-453d-a4a0-bb1fb443ee5e", "translation" => "حديقة المرجة للتسلية مكان ممتع وساحر يقدم مجموعة متنوعة من الأنشطة للزوار. يتضمن هذا المنتزه ليس فقط ألعابًا ومعالم جاذبة لجميع الأعمار، بل يضم أيضًا مجموعة من الحيوانات التي تضيف بعدًا فريدًا للتجربة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //416
            ["id" => "d3b00dc4-ee87-4f63-b2f3-4ff6e4805738", "translation" => "The tranquility and natural beauty of the merja Sidi Abed make it an attractive place for residents and visitors looking to escape the hustle and bustle of urban life and enjoy a peaceful, green setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c319270f-cbe9-4bb1-93e5-2988aaadb497", "translation" => "La tranquillité et la beauté naturelle de Merdja Sidi Abed en font un endroit attrayant pour les habitants et les visiteurs qui cherchent à échapper à l'agitation de la vie urbaine et à profiter d'un cadre paisible et verdoyant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6ad11220-0d50-49b4-bb88-ea7e4986f7f4", "translation" => "الهدوء والجمال الطبيعي في مرجة سيدي عابد يجعلانه مكانًا جاذبًا للسكان المحليين والزوار الذين يبحثون عن الهروب من صخب الحياة الحضرية والاستمتاع ببيئة هادئة وخضراء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //417
            ["id" => "19c4b8bd-a63c-4a66-beef-e6d0e1235ad0", "translation" => "Visitors can enjoy a refreshing swim in the natural waters of the pool, surrounded by the majestic beauty of the surrounding nature. Whether it's for swimming, sunbathing, or simply admiring the mountainous landscape, the Tamda pool offers a peaceful escape from the hustle and bustle of daily life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1c81825f-2f95-49ba-a240-35c04024bdf9", "translation" => "Les visiteurs peuvent profiter d'une baignade rafraîchissante dans les eaux naturelles de la piscine, entourée par la beauté majestueuse de la nature environnante. Que ce soit pour nager, se détendre au soleil ou simplement admirer le paysage montagnard, la piscine de Tamda offre une évasion paisible loin de l'agitation de la vie quotidienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6c1efcb8-a7e2-48ab-a7dd-a54e34e044bd", "translation" => "يمكن للزوار الاستمتاع بالسباحة المنعشة في مياه البركة الطبيعية، محاطين بجمال الطبيعة المهيبة. سواء كان الهدف السباحة أو التشمس أو مجرد التمتع بمناظر الجبال، يقدم مسبح تامدا ملاذًا هادئًا بعيدًا عن صخب الحياة اليومية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //418
            ["id" => "f3b7af1f-92c8-4946-8d1b-c461a0bfe6bf", "translation" => "The zaouia is a place steeped in tradition and spirituality. Every year, the 'Waada' of Sidi M'hamed Benaouda is celebrated by the residents of the Relizane province for an entire week.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d02bbb70-84f6-4f51-b051-20005b2b3508", "translation" => "La zaouia est un lieu empreint de traditions et de spiritualité. Chaque année, la « Waada » de Sidi M'hamed Benaouda est célébrée par les habitants de la wilaya de Relizane pendant toute une semaine entière.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "114a843b-c128-44ad-833d-dcf810328390", "translation" => "الزاوية هي مكان محمل بالتقاليد والروحانية. كل عام، يتم الاحتفال بـ 'الوعدة' لسيدي محمد بن عودة من قبل سكان ولاية غليزان لمدة أسبوع كامل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //419
            ["id" => "b8502131-e5fb-4420-891a-8fdfbb50ec49", "translation" => "The regional theater is a cultural venue that hosts theatrical performances and other artistic events. It provides a stage where artists can showcase their creations, and where the audience can enjoy a variety of shows.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a4fbda93-3bca-40c3-9a8b-06363ec3193a", "translation" => "Le théâtre régional est un lieu culturel qui abrite des représentations théâtrales et d'autres événements artistiques. Il offre une scène où les artistes peuvent présenter leurs créations et où le public peut profiter de spectacles variés.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f94c1cf4-fdfd-4332-85b2-bd6b09240ce7", "translation" => "المسرح الجهوي هو مكان ثقافي يستضيف العروض المسرحية والفعاليات الفنية الأخرى. يوفر مساحة أين يمكن للفنانين عرض إبداعاتهم، وحيث يمكن للجمهور الاستمتاع بمجموعة متنوعة من العروض.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //420
            ["id" => "8542bef1-31b8-4a38-9757-0e48a145f0bc", "translation" => "Whether for a leisurely stroll, a gathering with friends, or simply to soak in the lively atmosphere of the city, the Thagaste square provides a welcoming and vibrant space where culture, conviviality, and tradition converge.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9e79e93e-6482-4191-bfca-24fba37ae9eb", "translation" => "Que ce soit pour une balade tranquille, une rencontre entre amis ou simplement pour s'imprégner de l'atmosphère animée de la ville, la place Thagaste offre un espace accueillant et dynamique où la culture, la convivialité et la tradition se rencontrent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "924001b2-1bde-4462-9aef-e6edabcbed1f", "translation" => "سواء كنت تبحث عن نزهة هادئة أو لقاء مع الأصدقاء أو مجرد الاستمتاع بالأجواء الحية في المدينة، تقدم ساحة طاغاست مساحة ترحيبية وحيوية حيث تتلاقى فيها الثقافة والمرح والتقاليد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //421
            ["id" => "702de9cd-46b2-4ab9-a7ad-b436e8abcb02", "translation" => "The urban park of Souk Ahras is an ideal place for families with children. It provides a safe, fun, and educational space where children can play, explore, and create unforgettable memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "af7ec6d2-c719-4886-bf3b-8a573dfdce25", "translation" => "Le parc urbain de Souk Ahras est un endroit idéal pour les familles avec des enfants. Il offre un espace sûr, amusant et éducatif où les enfants peuvent jouer, explorer et créer des souvenirs inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "30e0b288-2c05-4dbd-868e-862b01625315", "translation" => "حديقة سوق أهراس الحضرية مكان مثالي للعائلات مع الأطفال. إنها توفر مكانًا آمنًا وممتعًا وتعليميًا حيث يمكن للأطفال اللعب واستكشاف وخلق ذكريات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //422
            ["id" => "1a18c1d9-63a1-43ff-9c3b-4c886903dc13", "translation" => "While the open-air theater in Souk Ahras may currently lack performances, its architectural beauty and charming atmosphere make it a place to explore for art and culture enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1f39f56c-c906-4231-bc6a-1cd9349efc6f", "translation" => "Bien que le théâtre en plein air de Souk Ahras puisse actuellement manquer de représentations, sa beauté architecturale et son ambiance charmante en font un lieu à découvrir pour les amateurs d'art et de culture.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "13167da4-9028-466b-8c23-11ea816dfcb6", "translation" => "على الرغم من أن مسرح الهواء الطلق في سوق أهراس قد يفتقر حاليًا إلى العروض المسرحية، إلا أن جماله المعماري وأجواؤه الساحرة يجعلانه مكانًا يجب استكشافه لعشاق الفن والثقافة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //423
            ["id" => "446d9c97-a463-4982-a9e4-1b2bbcfccb1e", "translation" => "The St Augustine's olive tree embodies the symbolism of unity, peace, and the cultural heritage of Souk Ahras. Its presence and beauty invite contemplation and reflection, reminding us of the importance of preserving and cherishing our shared heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "909b5b48-ad48-4d68-98c1-3f04ba915730", "translation" => "L'olivier de Saint Augustin incarne la symbolique de l'unité, de la paix et de l'héritage culturel de Souk Ahras. Sa présence et sa beauté sont une invitation à la contemplation et à la réflexion, rappelant l'importance de préserver et de valoriser notre patrimoine commun.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dd12b02f-2fdc-475d-911e-5374cd94e79f", "translation" => "شجرة زيتون القديس أوغسطينوس تجسد رمزية الوحدة والسلام والتراث الثقافي لمدينة سوق أهراس. وجودها وجمالها يدعوان إلى التأمل والتفكير، مذكرينا بأهمية الحفاظ على تراثنا المشترك وتقديره.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //424
            ["id" => "54db27be-105d-48ba-abb4-b502fde8b4f8", "translation" => "The house of culture contributes to enriching the cultural life of the city by providing opportunities for artistic development, entertainment, and learning.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3d4a785b-4853-469d-9c3a-4dabf4963d00", "translation" => "La maison de la culture contribue à enrichir la vie culturelle de la ville en offrant des opportunités d'épanouissement artistique, de divertissement et d'apprentissage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c3bbcbb5-7527-486a-836c-b0a09a790e09", "translation" => "دار الثقافة تسهم في إثراء الحياة الثقافية للمدينة من خلال توفير فرص للتطوير الفني والترفيه والتعلم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //425
            ["id" => "3aedda7c-8d28-4107-bb5a-72a6fc5e94a4", "translation" => "The Roman ruins of Madaure are a fascinating testament to the ancient history of the region. Among the remaining remnants are an amphitheater, an oil mill, baths, and a basilica, which provide valuable insights into the life and architecture of the Roman era.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b5b5224b-a156-43be-ae3b-2613d053b36e", "translation" => "Les ruines romaines de Madaure sont un témoignage fascinant de l'histoire antique de la région. Parmi les vestiges qui subsistent, on trouve notamment un amphithéâtre, une huilerie, des thermes et une basilique, qui offrent un aperçu précieux de la vie et de l'architecture de l'époque romaine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2efff32d-5796-4c05-84b0-ca7c3e2e0a94", "translation" => "أثار مادور الرومانية شاهد مثير على التاريخ القديم للمنطقة. من بين الآثار المتبقية تجدون مدرجًا رومانيًا ومعصرة زيتون وحمامات وكنيسة رئيسية، تقدم هذه البقايا نظرة قيمة على حياة وهندسة العصور الرومانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //426
            ["id" => "5c9dfdfb-a936-4bc8-84cb-a94f284a6aa1", "translation" => "The Roman ruins of Khemissa are a stunning archaeological site that bears witness to the ancient Roman presence in the region. These ruins include a collection of buildings and structures that were constructed during the Roman era and provide valuable insights into the life and architecture of that time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "07a4b0a1-3426-49e8-9128-b0d47d446b6b", "translation" => "Les ruines romaines de Khemissa sont un site archéologique époustouflant qui témoigne de l'ancienne présence romaine dans la région. Ces ruines comprennent un ensemble d'édifices et de structures qui ont été construits pendant l'époque romaine et qui offrent un aperçu précieux de la vie et de l'architecture de cette époque.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f89c6e2c-c2ef-48d8-94c6-34bede4083c1", "translation" => "أثار خميسة الرومانية موقع أثري رائع يشهد على الوجود الروماني القديم في المنطقة. تتضمن هذه الآثار مجموعة من المباني والهياكل التي تم بناؤها خلال العصر الروماني وتقدم رؤى قيمة عن الحياة والعمارة في تلك الفترة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //427
            ["id" => "0e6efdab-dc62-466b-92fd-7ba88c462c86", "translation" => "The former town hall of Souk Ahras is a magnificent structure dating back to the colonial era. Today, this architectural gem is closed to the public and no longer used as an administrative building. It may occasionally be undergoing renovation or preservation for heritage reasons. Nevertheless, its historical and architectural value makes it a testament to the colonial past of the region and it is often preserved as a historical monument.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6e764b69-d526-4904-b35d-d6d3ffed99ca", "translation" => "L'ancien hôtel de ville de Souk Ahras est un magnifique édifice datant de l'époque coloniale . De nos jours, ce bijou architectural est fermé au public et n'est plus utilisé comme bâtiment administratif. Il peut parfois être en cours de rénovation ou de préservation pour des raisons patrimoniales. Cependant, sa valeur historique et architecturale en fait un témoin du passé colonial de la région, et il est souvent conservé comme un monument historique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8475495e-bc4f-4eb6-9b59-b1753f8c02b0", "translation" => "البلدية القديمة سوق أهراس هيكل رائع يعود إلى العصر الاستعماري. في الوقت الحالي، هذا الجوهر المعماري مُغلق للجمهور ولا يُستخدم بعد كمبنى إداري. قد يكون بين الحين والآخر تحت عمليات تجديد أو حفظ لأسباب تراثية. ومع ذلك، قيمته التاريخية والمعمارية تجعله شاهدًا على الماضي الاستعماري للمنطقة، وغالبًا ما يُحتفظ به كمعلم تاريخي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //428
            ["id" => "c119956f-a271-4c89-b43c-7cb00c04b152", "translation" => "The El Amen Mosque is a religious building of remarkable architectural beauty. Both its elegant exterior and its simple interior symbolize the importance of religion and community in the lives of the people of Souk Ahras.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6b503948-c84a-4e4d-a692-f52190d3b069", "translation" => "La mosquée El Amen est un édifice religieux d'une beauté architecturale remarquable. Tant par son extérieur élégant que par son intérieur sobre, elle symbolise l'importance de la religion et de la communauté dans la vie des habitants de Souk Ahras.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "289ab7b9-5df3-4f35-b7de-89a313864287", "translation" => "مسجد الأمان هو مبنى ديني ذو جمالية معمارية استثنائية. سواء من خلال مظهره الخارجي الأنيق أو داخله البسيط، يرمز إلى أهمية الدين والمجتمع في حياة سكان سوق أهراس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //429
            ["id" => "a5a149ad-2321-4851-9606-b9ac6b8ad6c4", "translation" => "The Roman ruins of Taoura bear witness to the rich historical heritage of the region. Although the remains are limited today, they still provide a fascinating glimpse into the ancient Roman city that once existed at this location.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "70846889-035c-4d48-93be-84900d344dd8", "translation" => "Les ruines romaines de Taoura témoignent du riche héritage historique de la région. Bien que les vestiges soient aujourd'hui limités, ils offrent néanmoins un aperçu fascinant de l'ancienne cité romaine qui existait autrefois à cet endroit.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b2c1d282-feba-437e-a8b9-4996923521eb", "translation" => "أثار تاورة الرومانية تشهد على التراث التاريخي الغني للمنطقة. على الرغم من أن البقايا محدودة اليوم، إلا أنها تقدم لمحة رائعة عن المدينة الرومانية القديمة التي كانت موجودة في هذا الموقع في وقت مضى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //430
            ["id" => "22ccb291-f49c-49a7-8dce-a1125feaa5c6", "translation" => "This building is a living testament to the history of Guelma and the Roman influence in the region. Its preservation and ongoing use make it a cultural gem that reflects the significance of the architectural and artistic heritage of the Roman era.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "30609ee1-f302-4895-b95a-8a29e9acb324", "translation" => "Cet édifice est un témoignage vivant de l'histoire de Guelma et de l'influence romaine dans la région. Sa préservation et son utilisation continue en font un joyau culturel qui reflète l'importance de l'héritage architectural et artistique de l'époque romaine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "101becb4-cb66-4dc8-af3a-65a627c7dc5f", "translation" => "هذا المبنى هو شاهد حي على تاريخ قالمة وتأثير الحضارة الرومانية في المنطقة. الحفاظ عليه واستمرار استخدامه يجعله جوهرة ثقافية تعكس أهمية التراث المعماري والفني للعصر الروماني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //431
            ["id" => "d6ab62e9-c2c8-4f9c-a2f9-f9321db6151a", "translation" => "The Seridi Mustapha public garden, created in 1871, is a pleasant and green space that attracts passersby. In the past, it housed a significant collection of over 300 rare plants, sadly lost forever. However, remnants from the Roman and Byzantine eras are still visible in the garden, making it a place of historical interest.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7b6f4034-42c8-4059-b5d5-f9e40ba227f4", "translation" => "Le jardin public Seridi Mustapha, créé en 1871, est un lieu agréable et verdoyant qui attire les passants. Autrefois, il abritait une importante collection de plus de 300 plantes rares, malheureusement disparues à jamais. Cependant, des vestiges des époques romaines et byzantines sont toujours visibles dans le jardin, ce qui en fait un lieu d'intérêt historique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "87c8500c-f391-41ce-8590-a538cc889591", "translation" => "حديقة سريدي مصطفى العامة، التي تم إنشاؤها في عام 1871، هي مكان لطيف وأخضر يجذب المارة. في الماضي، كانت تحتوي على مجموعة كبيرة تضم أكثر من 300 نبات نادر، لكنها اختفت إلى الأبد. ومع ذلك، لا تزال آثار من العصور الرومانية والبيزنطية مرئية في الحديقة، مما يجعلها مكانًا ذو أهمية تاريخية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //432
            ["id" => "3e9d7462-c7f8-40c7-8996-166557c26bc2", "translation" => "The ruins of the Roman baths are a fascinating site that bears witness to the ancient grandeur of the city during the Roman era. These baths, dating back to the reign of Emperor Septimius Severus, provide insight into Roman architecture and bathing techniques.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e07eef4b-4c0c-44cb-8582-5f6376aab56f", "translation" => "Les ruines des thermes romains sont un site fascinant qui témoigne de l'ancienne grandeur de la ville à l'époque romaine. Ces thermes, qui remontent à l'époque du règne de l'empereur Septime Sévère, offrent un aperçu de l'architecture et des techniques de bain romaines.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6e3a2c8d-33de-4e39-8882-8e1f02b1a26e", "translation" => "آثار الحمامات الرومانية موقع رائع يشهد على عظمة المدينة في العصور القديمة أيام الرومان. هذه الحمامات، التي تعود إلى عهد الإمبراطور سبتيموس سيفيروس، تقدم لنا نظرة على الهندسة المعمارية الرومانية وتقنيات الاستحمام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //433
            ["id" => "d4566ee9-658a-42ed-8198-7f97ecd120c0", "translation" => "Whether it's to attend a captivating theatrical performance, an enchanting concert, or a unique artistic show, the municipal theater of Guelma is a place that excites and fosters an appreciation for the arts among its audience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2833e07d-17c4-4217-abd5-4b6a94148ed1", "translation" => "Que ce soit pour assister à une représentation théâtrale captivante, à un concert envoûtant ou à une performance artistique unique, le théâtre municipal de Guelma est un lieu qui suscite l'enthousiasme et l'appréciation des arts chez les spectateurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "51f00b3b-5246-4f8b-a987-51767abcdb44", "translation" => "سواء كنتم ترغبون في حضور عرض مسرحي مثير، أو حفل موسيقي ساحر، أو عرض فني فريد، فإن المسرح البلدي في قالمة هو مكان يثير الحماس ويشجع على تقدير الفنون بين الجمهور.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //434
            ["id" => "904a40ba-647b-4f64-8329-c681c0dd371d", "translation" => "The archaeological garden of Calama is a historical treasure located in the heart of the city of Guelma, near the Roman theater. It houses an archaeological museum that gathers ancient objects from various sites in the region, such as Khemissa and Madour in Souk Ahras.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e82742c5-e7aa-4ce7-8add-a6aca306e8d4", "translation" => "Le jardin archéologique de Calama est un trésor historique situé au cœur de la ville de Guelma, à proximité du théâtre romain. Il abrite un musée archéologique qui rassemble des objets anciens provenant de divers sites de la région, tels que Khemissa et Madour à Souk Ahras.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "092fd7d9-339d-43af-b777-8dc6a0ba9ea3", "translation" => "حديقة كالاما الأثرية هي كنز تاريخي يقع في قلب مدينة قالمة، بالقرب من المسرح الروماني. تحتضن المتحف الأثري مجموعة من القطع القديمة التي تأتي من مواقع متنوعة في المنطقة، مثل خميسة ومادور في سوق أهراس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //435
            ["id" => "e6b9c93f-a647-47b0-a8ed-a002e803ea0f", "translation" => "Today, the Roman pool of Heliopolis stands as a fascinating testament to the ingenuity and sophistication of Roman architecture. While it has weathered the passage of time, it still retains much of its original structure. This impressive basin, which offers insights into the lifestyles of Romans of that era, is a site of historical and cultural significance not to be missed by visitors to Guelma.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4bb0024e-f4e7-4806-8b26-f12c88f21d96", "translation" => "Aujourd'hui, la piscine romaine d'Héliopolis est un témoin fascinant de l'ingéniosité et de la sophistication de l'architecture romaine. Bien qu'elle ait subi les ravages du temps, elle conserve encore une grande partie de sa structure originale. Cet impressionnant bassin, qui témoigne du mode de vie des romains de l'époque, est un site d'intérêt historique et culturel à ne pas manquer pour les visiteurs de Guelma.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1a6d2f18-c799-4361-948d-edda0074120d", "translation" => "يعتبر المسبح الروماني في هيليوبوليس شاهدًا رائعًا على براعة وتطور الهندسة المعمارية الرومانية. على الرغم من تأثرها بمرور الزمن، إلا أنها لا تزال تحتفظ بجزء كبير من هيكلها الأصلي. يُعد هذا المسبح الرائع، الذي يقدم نظرة على أسلوب حياة الرومان في تلك الفترة، موقعًا ذا أهمية تاريخية وثقافية لا ينبغي تفويته بالنسبة لزوار ولاية قالمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //436
            ["id" => "0ef68696-f929-4736-b85b-8c241ae51f06", "translation" => "This monument commemorates the events of May 8, 1945, and the heroic battles that took place in Guelma during the national liberation war. Next to the memorial, a large mural depicts the martyrs of the revolution, with their names engraved on the wall.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cbe89775-fa24-47e5-b5c6-253e71466f6d", "translation" => "Ce monument commémore les manifestations du 8 mai 1945 et les batailles héroïques qui ont eu lieu à Guelma pendant la guerre de libération nationale. À côté du mémorial, une grande fresque murale représente les martyrs de la révolution, avec leurs noms gravés sur le mur.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7e87c26b-6a6f-43e9-906e-c6c73f9d4678", "translation" => "يعتبر هذا النصب تذكاري لأحداث 8 ماي 1945 والمعارك البطولية التي جرت في ولاية قالمة خلال حرب التحرير الوطنية. بجوار النصب، تصور لوحة جدارية كبيرة لشهداء الثورة، مع أسمائهم منقوشة على الجدار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //437
            ["id" => "4f12a279-bc79-40d5-a64a-c6be3f5c653a", "translation" => "The museum of the mujahid in Guelma is an iconic place dedicated to the preservation and promotion of the history of the national liberation war. It houses a rich and diverse collection of objects, documents, and photographs that recount the struggle and sacrifices of the mujahideen for the independence of the country.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6225c832-e361-4595-955a-6ce8aa407848", "translation" => "Le musée du Moudjahid de Guelma est un lieu emblématique consacré à la préservation et à la valorisation de l'histoire de la guerre de libération nationale. Il abrite une collection riche et diversifiée d'objets, de documents et de photographies relatant le combat et les sacrifices des moudjahidine pour l'indépendance du pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d200e304-e6a6-4456-b02b-267c68baf47f", "translation" => "متحف المجاهد في قالمة هو مكان رمزي مخصص للحفاظ على تاريخ حرب التحرير الوطني وتعزيزه. يضم مجموعة غنية ومتنوعة من الأشياء والوثائق والصور تروي قصة النضال والتضحيات التي قدمها المجاهدين من أجل استقلال البلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //438
            ["id" => "e3ca0417-1474-4ad3-9ae6-15c769b11fcb", "translation" => "The monument to the Martyrs of Guelma is an iconic place where history and memory converge, allowing visitors to pay tribute to the heroes of the national liberation war while appreciating the beauty of the surrounding landscape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3f0f3cc3-d0f4-43c2-9010-b951ba52717d", "translation" => "Le monument aux martyrs de Guelma est un lieu emblématique où l'histoire et la mémoire se rencontrent, permettant aux visiteurs de rendre hommage aux héros de la guerre de libération nationale tout en appréciant la beauté du paysage qui les entoure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "223e80c2-9768-41b1-806c-ed823ce2d5c4", "translation" => "مقام الشهيد في ولاية قالمة هو مكان رمزي حيث تتقاطع التاريخ والذاكرة، مما يسمح للزوار بتقديم العرفان لأبطال حرب التحرير الوطني بينما يستمتعون بجمال المشهد المحيط بهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //439
            ["id" => "4cbc2754-e4b2-46a4-9211-170392730aeb", "translation" => "The Hammam Debagh Waterfall is one of the most remarkable tourist sites in the province. Fed by two thermal water sources, this 15-meter high and 90-meter wide waterfall is the result of limestone accumulation over the years.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0ee6112f-64ba-42e7-ad4c-33c93b4ca3ff", "translation" => "La cascade de Hammam Debagh est l'un des sites touristiques les plus remarquables de la wilaya. Alimentée par deux sources d'eau thermale, cette cascade de 15 mètres de hauteur et 90 mètres de surface est le résultat de l'accumulation de calcaire au fil des années.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0ef0fd10-df34-4061-81fe-d47ce8b5b565", "translation" => "شلال حمام دباغ هو واحد من أبرز المواقع السياحية في الولاية. يُغذيه اثنان من ينابيع المياه الحرارية، وهذا الشلال البالغ ارتفاعه 15 مترًا وعرضه 90 مترًا هو نتيجة تراكم الحجر الجيري على مر السنين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //440
            ["id" => "536f8533-24da-4c15-acd7-74980881816e", "translation" => "The surroundings of the Hammam Debagh waterfall are filled with renowned thermal resorts known for their beneficial waters. These thermal resorts provide visitors with opportunities for relaxation, treatments, and well-being.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2f695f60-889e-454f-b58a-acbc6ed045e8", "translation" => "Les environs de la cascade de Hammam Debagh regorgent de stations thermales réputées pour leurs eaux bienfaisantes. Ces stations thermales offrent aux visiteurs des opportunités de détente, de soins et de bien-être.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "20e7d2d8-847a-4e6d-a45d-f1cf2e333606", "translation" => "محيط شلال حمام دباغ يزخر بالمنتجعات الشهيرة بمياهها المفيدة. تقدم هذه المنتجعات الحرارية للزوار فرصًا للاسترخاء والعلاج والاستفادة من العناية بالصحة والعافية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //441
            ["id" => "9f51e631-73fe-4221-b1e5-010c059c5360", "translation" => "The underground lake of Bir Ben Osman is a mysterious place that has always piqued the curiosity of locals and tourists alike. This location offers a unique opportunity to explore an enigmatic environment and make surprising discoveries.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e4851f6a-8265-48a2-b1d3-f096a687d862", "translation" => "Le lac souterrain de Bir Ben Osman est un endroit mystérieux qui a toujours suscité la curiosité des habitants et des touristes. Ce lieu offre une opportunité unique d'explorer un environnement énigmatique et de faire des découvertes surprenantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8eeb57ca-2002-4a3a-b88c-ffd1cbef18c9", "translation" => "بحيرة بئر بن عثمان التحتية هي مكان غامض أثار دائماً فضول السكان المحليين والسياح على حد سواء. هذا الموقع يقدم فرصة فريدة لاستكشاف بيئة غامضة وجعل اكتشافات مذهلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //442
            ["id" => "f944e28e-bd0c-436a-9d02-b104d8dd2d1f", "translation" => "The cone plateau is formed by limestone rocks in various sizes and shapes. This ensemble represents a rare natural masterpiece that has become a popular tourist destination for families and children. In summary, it is a perfect place to enjoy a picnic and relax.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "713abd31-3acd-4c6b-9c64-4c4eff07b470", "translation" => "Le plateau des cônes est formé de roches calcaires en forme de cônes de tailles variées. Cet ensemble constitue un véritable chef-d'œuvre naturel rare qui est devenu une destination touristique prisée des familles et des enfants. En somme, c'est un lieu parfait pour profiter d'un pique-nique et se ressourcer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e81c2b3f-36dc-4568-ae0d-a01f0117ae63", "translation" => "العرايس مكونة من أسطوانات من الحجر الجيري بأحجام وأشكال متنوعة. يمثل هذا التجمع معجزة طبيعية نادرة أصبحت وجهة سياحية مشهورة بين العائلات والأطفال. بشكل ملخص، إنه مكان مثالي للاستمتاع بنزهة والاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //443
            ["id" => "5b609efd-c7c8-444d-89fb-c3756d591028", "translation" => "The Roman ruins of Thibilis include fascinating remnants from the Roman era, including a basilica, a triumphal arch, and a forum. These ruins are an invaluable archaeological treasure that allows visitors to delve into the history of the ancient Roman city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "49d6745a-be73-43cd-a2f7-2be3f47cf4b4", "translation" => "Les ruines romaines de Thibilis comprennent des vestiges fascinants de l'époque romaine, parmi lesquels se trouvent une basilique, un arc triomphal et un forum. Ces ruines sont un trésor archéologique inestimable qui permet aux visiteurs de plonger dans l'histoire de l'ancienne cité romaine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0a56a5ec-eeb0-4557-a23b-13a6173e1bf2", "translation" => "أثار تيبيليس الرومانية تشمل بقايا مثيرة من العصور الرومانية، بما في ذلك بازيليكا، وقوس انتصاري، وساحة عامة. هذه الآثار هي كنز أثري لا يُقدَّر بثمن يتيح للزوار الغوص في تاريخ المدينة الرومانية القديمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //444
            ["id" => "2d25d9e0-57d7-4863-9313-1c2bff2b3f82", "translation" => "The charm of this place and its rich history make it a fascinating place to explore. Visitors can immerse themselves in the remnants of the past and appreciate the natural beauty of the stalagmites and stalactites formations. Ghar Jemaa is a true cultural and archaeological treasure that offers a unique experience to visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fbec30f5-3307-4a00-80e9-aa0d92f085cd", "translation" => "Le charme de cet endroit et sa riche histoire en font un lieu fascinant à explorer. Les visiteurs peuvent se plonger dans les vestiges du passé et apprécier la beauté naturelle des formations de stalagmites et de stalactites. Le ghar Jemaa est un véritable trésor culturel et archéologique qui offre une expérience unique aux visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "38871b7c-f49d-457c-8823-ae1d51aec7b4", "translation" => "جاذبية هذا المكان وتاريخه الغني يجعلانه مكانًا مثيرًا للاستكشاف. يمكن للزوار أن ينغمسوا في أطلال الماضي ويقدروا جمال تشكيلات المقرنصات والصواعد الطبيعية. غار جماعة هو كنز حقيقي من الثقافة والآثار يقدم تجربة فريدة للزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //445
            ["id" => "c9be7372-0531-41eb-95aa-379ef577f4cb", "translation" => "The Oued Leblied waterfalls are an impressive natural sight, offering a magnificent view of a majestic waterfall. The water cascades with force, creating a soothing sound that adds to the natural and relaxing atmosphere of the place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0881525b-f055-4291-bded-4697c1dc981f", "translation" => "Les chutes du Oued Leblied sont un spectacle naturel impressionnant, offrant une vue magnifique sur une chute d'eau majestueuse. L'eau dévale avec force et crée un bruit apaisant qui ajoute à l'ambiance naturelle et relaxante du lieu.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d98b9f5a-53bf-4a35-98c6-fa390bc1fe0a", "translation" => "شلالات واد البيض هي مشهد طبيعي مذهل، تقدم إطلالة رائعة على شلال مهيب. تتدفق المياه بقوة مما يخلق صوتًا مهدئًا يضيف إلى الأجواء الطبيعية والمريحة في المكان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //446
            ["id" => "9ac8a2bb-c0ee-49bb-bddf-01d779b2c531", "translation" => "The megalithic necropolis of Roknia is an archaeologically significant site in North Africa. It is characterized by its exceptional concentration of dolmens and hypogea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2cae993a-2331-4a23-a21f-b6fefeff1233", "translation" => "La nécropole mégalithique de Roknia est un site archéologique d'une grande importance en Afrique du Nord. Elle se distingue par sa concentration exceptionnelle de dolmens et d'hypogées.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a0dc9480-0e97-414d-872b-302d30c1fbcf", "translation" => "المقابر الميغاليتية في الركنية هي موقع أثري ذو أهمية كبيرة في شمال أفريقيا. يتميز بتراكم استثنائي للأضرحة والهيبوجيا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //447
            ["id" => "92dc5ffa-1f05-412b-bcd4-d6c276244fd8", "translation" => "The chamber of crafts and trades of Guelma is an institution dedicated to the promotion and development of local craftsmanship. It plays a crucial role in preserving artisanal traditions and promoting the expertise of artisans.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bcec8c44-efe4-4874-a606-f74069023cdb", "translation" => "La chambre de l'artisanat et des métiers de Guelma est une institution dédiée à la promotion et au développement de l'artisanat local. Elle joue un rôle essentiel dans la préservation des traditions artisanales et la valorisation du savoir-faire des artisans.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "27891279-dd53-45e0-b009-be67ef47fd70", "translation" => "غرفة الحرف والصناعات التقليدية في قالمة هي مؤسسة مخصصة لتعزيز وتطوير الحرف المحلية. إنها تلعب دورًا حاسمًا في الحفاظ على التقاليد الحرفية وتعزيز خبرة الحرفيين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //448
            ["id" => "13e8c85b-ff02-48d5-b787-29df08e2170c", "translation" => "The Blue lake is a beautiful body of water formed by a flowing spring that turns into a stunning waterfall. It is located in an enchanting natural setting, combining lush vegetation and imposing rock formations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cf0e495f-c0e5-4272-af6c-bfc221f3f4fa", "translation" => "Le lac bleu est un magnifique plan d'eau formé par une source d'eau courante qui se transforme en une belle cascade. Il est situé dans un cadre naturel enchanteur, mêlant une végétation luxuriante et des formations rocheuses imposantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "568afa1e-4145-48c4-9fcb-4e65ca104fe9", "translation" => "القلتة الزرقاء هي جسم مائي جميل يتكون من ينبوع مائي جاري يتحول إلى شلال جميل. تقع في إطار طبيعي ساحر، حيث تجمع بين النباتات الخضراء الكثيفة وتكوينات صخرية مهيبة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //449
            ["id" => "4a8c19ed-6430-412c-b707-ffc3a74e48b3", "translation" => "The el Atik mosque (Ibn Khaldoun) is an architectural gem that bears witness to the history and spirituality of Guelma. It is not only a place of prayer and reflection but also a symbol of the cultural and religious richness of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c8f30ab9-c80e-46fa-abfa-4c6b25f09fa3", "translation" => "La mosquée El-Atik (Ibn Khaldoun) est un joyau architectural qui témoigne de l'histoire et de la spiritualité de Guelma. Elle est non seulement un lieu de prière et de recueillement, mais aussi un symbole de la richesse culturelle et religieuse de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "92895b1e-b34b-4ea0-9996-24162ddb274f", "translation" => "المسجد العتيق (ابن خلدون) هو جوهرة معمارية تشهد على تاريخ وروحانية قالمة. إنها ليست مكانًا للصلاة والتأمل فقط، بل هي أيضًا رمز للثراء الثقافي والديني للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //450
            ["id" => "4cfa6047-03e8-441c-9554-64e401d031f8", "translation" => "The chouaf rock is perched on mount Bouarbid, which reaches a height of 1,200 meters, at the convergence of the borders of the Guelma, Constantine, and Skikda provinces. Offering breathtaking panoramic views, this location allows you to admire the beaches of Annaba and Skikda, as well as some areas of Constantine.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a79df666-547c-435e-b866-5234471ad023", "translation" => "Le rocher chouaf est perché sur le mont Bouarbid, qui atteint une hauteur de 1 200 mètres, à la convergence des frontières des wilayas de Guelma, Constantine et Skikda. Offrant des vues panoramiques époustouflantes, cet endroit permet d'admirer les plages d'Annaba et de Skikda, ainsi que certaines régions de Constantine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "99f3f761-b9ac-4547-ba96-a946f4c3103e", "translation" => "حجر الشواف موجودة على قمة جبل بوعربيد، الذي يبلغ ارتفاعه 1200 مترًا، حيث تتقاطع حدود ولايات قالمة وقسنطينة وسكيكدة. يقدم هذا الموقع مناظر بانورامية خلابة تسمح لك بمشاهدة شواطئ عنابة وسكيكدة، وبعض المناطق في ولاية قسنطينة أيضًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //451
            ["id" => "3441f34a-168b-4a0d-9978-e7720039371e", "translation" => "A beloved spot for nature enthusiasts and visitors seeking natural beauty. The Oued el Kebir waterfalls are a true visual spectacle and an unforgettable experience for all who gaze upon them.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b3229307-861a-4c67-ade2-ed35efe2e3d9", "translation" => "Un lieu apprécié des amateurs de nature et des visiteurs en quête de beauté naturelle. Les chutes de Oued el Kebir sont un véritable spectacle visuel et une expérience inoubliable pour tous ceux qui les contemplent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "95be2ce3-a35f-4bdd-8cb6-62ec72167874", "translation" => "مكان محبب لعشاق الطبيعة والزوار الباحثين عن الجمال الطبيعي. شلالات واد الكبير هي عرض بصري حقيقي وتجربة لا تُنسى بالنسبة لجميع الذين يتأملونها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //452
            ["id" => "4e772a5a-0cbc-43ec-9a92-e4569001e948", "translation" => "The monument to the Fallen of Constantine is an imposing structure that overlooks the Rhummel gorges, offering visitors a magnificent view of the city and its surroundings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5ce2142b-b0ce-4da8-badb-272817fae4a6", "translation" => "Le monument aux morts de Constantine est un imposant édifice qui surplombe les gorges du Rhummel, offrant aux visiteurs une vue magnifique sur la ville et ses environs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "015c396e-4a72-472d-8895-0c3f0c66329c", "translation" => "نصب الأموات في قسنطينة هو هيكل ضخم يطل على مضائق نهر الرمال، مما يوفر للزوار إطلالة رائعة على المدينة ومحيطها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //453
            ["id" => "e8fa0a39-cba6-4a2d-8e5b-55650c7390c2", "translation" => "The Bennacer square is a charming public space located in the heart of Constantine. This square provides a place for relaxation and recreation for the city's residents and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "294f3257-47f8-4c0e-9ca5-fd11734f5d36", "translation" => "Le square Bennacer est un charmant espace public situé au cœur de Constantine. Ce square offre un lieu de détente et de loisirs pour les habitants et les visiteurs de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "30e01c54-9eb1-4e29-ad18-daa6e83aa813", "translation" => "ساحة بن ناصر هي مساحة عامة ساحرة تقع في قلب قسنطينة. توفر هذه الساحة مكانًا للراحة والترفيه لسكان المدينة وزوارها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //454
            ["id" => "edbb72fa-2cb3-4d3d-bdf7-ad16f5460e0f", "translation" => "The culture palace in Constantine is a must-visit for art and culture enthusiasts, offering a diverse program that contributes to enriching the city's cultural scene.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ad5d2c2e-ea9a-4426-86c5-24fb2e027625", "translation" => "Le palais de la culture de Constantine est un lieu incontournable pour les amateurs d'art et de culture, offrant une programmation variée qui contribue à l'enrichissement de la scène culturelle de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "11686cc6-877b-468a-b776-f6b973b7d6ab", "translation" => "قصر الثقافة في قسنطينة هو مكان لا بد من زيارته لعشاق الفن والثقافة، حيث يقدم برنامجًا متنوعًا يسهم في إثراء الحياة الثقافية في المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //455
            ["id" => "ea05ab40-feea-467a-9afa-99abdd40456b", "translation" => "The Cirta museum is a must-visit for history and archaeology enthusiasts, offering a fascinating glimpse into the millennia-old history of the region. It's a place of discovery and cultural enrichment that contributes to preserving and showcasing the local heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b311fc1f-fcf1-483e-96f2-09ed73dc7773", "translation" => "Le musée Cirta est un lieu incontournable pour les amateurs d'histoire et d'archéologie, offrant un aperçu fascinant de l'histoire millénaire de la région. C'est un lieu de découverte et d'enrichissement culturel qui contribue à préserver et à valoriser le patrimoine local.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ec2c7c4f-5fb7-434d-93a0-4f615adb415e", "translation" => "متحف سيرتا هو وجهة لا غنى عنها لهواة التاريخ والآثار، حيث يقدم لمحة رائعة عن تاريخ الإقليم العريق عبر الآف السنين. إنه مكان للاكتشاف الثراء الثقافي و يسهم في الحفاظ على التراث المحلي وتسليط الضوء عليه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //456
            ["id" => "b153ba16-71e6-431b-820e-511a1d3b6bdd", "translation" => "The regional theater of Constantine is an iconic cultural establishment located in the heart of the city. It is a place dedicated to the performing arts, providing a platform for theatrical performances, musical shows, dance, and other forms of artistic expression.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "29c27e0e-7ec5-41f9-9b2e-0ef555225896", "translation" => "Le théâtre régional de Constantine est un établissement culturel emblématique situé au cœur de la ville. C'est un lieu dédié aux arts de la scène, offrant une plate-forme pour les représentations théâtrales, les spectacles musicaux, la danse et d'autres formes d'expressions artistiques", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a6f5d711-ecd7-41ae-bf6f-a7b359450cd9", "translation" => "المسرح الجهوي لقسنطينة هو مؤسسة ثقافية بارزة تقع في قلب المدينة. إنه مكان مخصص لفنون الأداء، حيث يقدم منصة للعروض المسرحية والعروض الموسيقية والرقص وأشكال أخرى من التعبير الفني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //457
            ["id" => "a30ce61b-791b-49b4-9984-f151771bb04e", "translation" => "The Bardo garden provides visitors with a space for relaxation and leisure, where they can enjoy extensive green areas, shaded trails, and beautiful natural landscapes. The renovated facilities and new amenities add a dimension of comfort and entertainment, allowing visitors to relax, dine, and engage in recreational activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d9dcfff0-8d19-4ccc-9c97-576287910fc4", "translation" => "Le parc du Bardo offre aux visiteurs un espace de détente et de loisirs, où ils peuvent profiter de vastes étendues verdoyantes, de sentiers ombragés et de magnifiques paysages naturels. Les installations rénovées et les nouveaux équipements ajoutent une dimension de confort et de divertissement, permettant aux visiteurs de se détendre, de se restaurer et de profiter d'activités récréatives.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "80f0a913-2a2c-4091-be40-5bee8d892c9e", "translation" => "الحديقة باردو توفر للزوار مكانًا للاسترخاء والترفيه، حيث يمكنهم الاستمتاع بمساحات خضراء واسعة وممرات مظللة ومناظر طبيعية جميلة. تعزز المرافق المجددة بعدًا من الراحة والترفيه، مما يتيح للزوار الاسترخاء والمشاركة في أنشطة ترفيهية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //458
            ["id" => "337b152d-70af-4757-8cc9-d667452247e7", "translation" => "The Constantine statue is an iconic landmark of the city, reminding both residents and visitors of the connection between the ancient city of Cirta and its restorer. It also bears witness to the significance of the Roman heritage and its influence on the architecture, culture, and history of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "078532bf-a58d-4acb-92e9-0ceaf06925ad", "translation" => "La statue de Constantin est un point de repère emblématique de la ville, rappelant aux habitants et aux visiteurs le lien entre l'ancienne ville de Cirta et son restaurateur. Elle témoigne également de l'importance de l'héritage romain et de son impact sur l'architecture, la culture et l'histoire de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "64083176-8a65-4a68-8ff3-b14e46137921", "translation" => "تمثال قسطنطين هو معلم بارز في المدينة، يُذكّر السكان والزوار بالارتباط بين المدينة القديمة سيرتا ومعمرها. كما يشهد على أهمية التراث الروماني وتأثيره على الهندسة المعمارية والثقافة والتاريخ للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //459
            ["id" => "9365bc24-1306-4cff-9130-6422fdd9c620", "translation" => "The Emir Abdelkader mosque is a symbol of piety, knowledge, and Islamic art. It embodies the greatness of Algerian faith and culture, attracting visitors with its majesty and profound significance. It is a place of spiritual and intellectual gathering that testifies to the richness of Constantine's and Algeria's religious and cultural heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "860b61e6-a874-4677-a98a-d0ee392d8f0d", "translation" => "La mosquée Emir Abdelkader est un symbole de piété, de savoir et d'art islamique. Elle incarne la grandeur de la foi et de la culture algériennes, attirant les visiteurs par sa majesté et sa signification profonde. C'est un lieu de rassemblement spirituel et intellectuel qui témoigne de la richesse du patrimoine religieux et culturel de Constantine et de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bbdb6c9d-4631-4901-a524-337e9048e514", "translation" => "مسجد الأمير عبد القادر هو رمز للزهد والمعرفة والفن الإسلامي. إنه يجسد عظمة الإيمان والثقافة الجزائرية، مما يجذب الزوار بعظمته وأهميته العميقة. إنه مكان للتجمع الروحي والفكري يشهد على ثراء التراث الديني والثقافي لمدينة قسنطينة والجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //460
            ["id" => "06bc507a-e9cb-4fc6-9865-d8475f097162", "translation" => "The el Kantara bridge is not only a means to cross the Rhummel river but also a symbol of the natural and architectural beauty of Constantine.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "317c7ece-1efb-424b-bbbe-7968c53346f8", "translation" => "Le pont el Kantara est non seulement un moyen de traverser le Rhummel, mais aussi un symbole de la beauté naturelle et architecturale de Constantine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dab2961c-a76a-4b1c-ba53-43c07bd2845b", "translation" => "جسر القنطرة ليس فقط وسيلة لعبور نهر الرمال ولكنه أيضًا رمز لجمال الطبيعة والعمارة في قسنطينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //461
            ["id" => "7b5cc048-8bbc-4561-a9c3-493f1cddcc28", "translation" => "Whether to admire the view, stroll along the river, or simply soak in the lively atmosphere of the city, the Sidi Rached bridge is a must-visit place in Constantine. It embodies the history, beauty, and identity of this remarkable city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "52e54af9-f521-4f56-a038-d7cc5175d92b", "translation" => "Que ce soit pour admirer la vue, se promener le long du fleuve ou simplement profiter de l'atmosphère animée de la ville, le pont Sidi Rached est un lieu incontournable à Constantine. Il incarne l'histoire, la beauté et l'identité de cette ville remarquable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b40b8a62-82ad-4a73-b215-1f8c9e39f1dc", "translation" => "سواءً كان الهدف هو التمتع بالإطلالة أو التجول على طول النهر أو مجرد الاستمتاع بالأجواء الحية للمدينة، يعد جسر سيدي راشد مكانًا لا بد من زيارته في قسنطينة. إنه يجسد التاريخ والجمال وهوية هذه المدينة الرائعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //462
            ["id" => "efe947bb-4b2c-47ce-9769-b23781673f0e", "translation" => "The Sidi M'Cid bridge is not only a means of crossing the Rhummel gorges but also a major tourist attraction in Constantine. Visitors can enjoy breathtaking views of the gorges, cliffs, and the typical white houses of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "89220f54-88f7-465f-a7df-c6c4ac348d4f", "translation" => "Le pont de Sidi M'Cid est non seulement un moyen de traverser les gorges du Rhummel, mais aussi une attraction touristique majeure de Constantine. Les visiteurs peuvent admirer la vue imprenable sur les gorges, les falaises et les maisons blanches typiques de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "aee8b03c-4c52-4bd7-bfb6-bbcd63d87a82", "translation" => "جسر سيدي مسيد ليس مجرد وسيلة لعبور نهر الرمال، بل هو أيضًا معلم سياحي رئيسي في قسنطينة. يمكن للزوار التمتع بمناظر خلابة للمضائق والمنازل البيضاء التقليدية للمدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //463
            ["id" => "c57f421b-2131-46fe-8eee-fad2d2bff994", "translation" => "The waterfalls bridge marks the end point of the Rhummel tourist circuit, providing visitors with an impressive view of the natural beauty of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0bfd7025-35e4-4348-8ef6-d7e5456900d8", "translation" => "Le Pont des chutes marque le point final du circuit touristique du Rhummel, offrant aux visiteurs une vue impressionnante sur la beauté naturelle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e571822d-c89d-4deb-a329-e4f7d84a03a2", "translation" => "جسر الشلالات يشكل النقطة النهائية لجولة السياحة في نهر الرمال، مما يوفر للزوار إطلالة رائعة على جمال الطبيعة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //464
            ["id" => "76e0d621-8dab-40e2-8456-55d95932ecb7", "translation" => "The Ahmed Bey palace is widely recognized as one of the major tourist attractions in the city. This magnificent palace is a testament to the history and cultural richness of the region. With its impressive architecture and unique design, it attracts visitors who want to explore the royal heritage and the grandeur of the past.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "14193077-3697-4012-ac94-73ba3d497b07", "translation" => "Le palais Ahmed Bey est largement reconnu comme l'une des attractions touristiques majeures de la ville. Ce magnifique palais témoigne de l'histoire et de la richesse culturelle de la région. Avec son architecture impressionnante et son design unique, il attire les visiteurs qui souhaitent découvrir l'héritage royal et la splendeur du passé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c9698c86-373e-4d22-a6aa-bcf0eb6a05bd", "translation" => "قصر أحمد باي معروف على نطاق واسع كواحد من أبرز معالم الجذب السياحي في المدينة. هذا القصر الرائع يعكس تاريخ وثراء الثقافة في المنطقة. بفضل هندسته الرائعة وتصميمه الفريد، يجذب الزوار الذين يرغبون في استكشاف التراث الملكي وعظمة الماضي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //465
            ["id" => "8eafca31-874e-421b-ab4a-86d4be3519c4", "translation" => "The Mellah Slimane footbridge, formerly known as Perregaux, is an iconic pedestrian bridge in the city and a significant tourist attraction that provides visitors with a breathtaking panoramic view.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7051b4c6-011d-4bc8-8712-b0bd55c3d69c", "translation" => "La passerelle Mellah Slimane, autrefois connue sous le nom de Perrégaux, est une passerelle piétonne emblématique de la ville et une attraction touristique importante offrant aux visiteurs un panorama à couper le souffle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c7256d50-e02d-42fe-b84f-682d303f4bb2", "translation" => "جسر ملاح سليمان للمشاة, المعروف سابقًا ببيريڨو، هو جسر مشاة أيقوني في المدينة ومعلم سياحي مهم يوفر للزوار إطلالة خلابة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //466
            ["id" => "655d09af-4f8a-408d-8b84-0de0cad3f2b1", "translation" => "The Gambetta garden is a leisure and recreational spot beloved by the city's residents and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2dc0665d-a81d-4d1c-abdf-42e9fc2df6f6", "translation" => "Le jardin Gambetta est un lieu de détente et de loisirs apprécié des habitants et des visiteurs de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "69383797-835a-4d41-8323-3610ba2c8418", "translation" => "حديقة غامبيتا هي مكان للترفيه والاستجمام يحظى بشعبية كبيرة بين سكان المدينة والزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //467
            ["id" => "20846813-d389-4992-bcc1-5fe692b53297", "translation" => "The November 1st square is a popular meeting place for the residents of Constantine, as well as for visitors looking for an authentic experience of a lively market and the discovery of local products.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c5408602-9884-450c-8241-6330de0db173", "translation" => "La place du 1er Novembre est un lieu de rencontre populaire pour les habitants de Constantine, ainsi que pour les visiteurs en quête de l'expérience authentique d'un marché animé et de la découverte de produits locaux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "eb862a7e-995e-4164-9bf5-d6637ca6f8ef", "translation" => "ساحة 1 نوفمبر هي مكان اجتماع شعبي لسكان قسنطينة، وكذلك للزوار الباحثين عن تجربة أصيلة في سوق نابض بالحياة واكتشاف المنتجات المحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //468
            ["id" => "9efa37fd-bb38-445a-9588-05af6f235147", "translation" => "The statue of Our Lady of Peace is an imposing sculpture located on Mount Sidi M'Cid. However, access to it is restricted due to its location in a military area.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7ad02d4b-7d69-4521-ac08-78313a9ad055", "translation" => "La statue de Notre Dame de la Paix est une imposante sculpture située sur le mont Sidi M'Cid. L’accès y est cependant restreint en raison de sa localisation dans une zone militaire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "65f6c6f1-00c7-4494-8b31-07778ee9e68c", "translation" => "تمثال سيدة السلام هو نصب تذكاري ضخم يقع على جبل سيدي مسيد. ومع ذلك، يتم تقييد الوصول إليه بسبب موقعه في منطقة عسكرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //469
            ["id" => "79295735-4111-4d0f-b0ba-34f6ac7c29b2", "translation" => "The ruins of Tiddis offer a fascinating testament to the history and diversity of civilizations that have succeeded in North Africa. This Berber village, dating back to the Neolithic period, covers an area of 41 hectares and contains numerous caves that were once used for religious rituals.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4532f9d3-3d6a-4224-8274-175198e8cc35", "translation" => "Les ruines de Tiddis offrent un témoignage fascinant de l'histoire et de la diversité des civilisations qui se sont succédé en Afrique du Nord. Ce village berbère, datant de la période néolithique, s'étend sur une superficie de 41 hectares et abrite de nombreuses grottes, autrefois utilisées pour des rituels religieux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7f1bbfd3-14fd-491b-a99f-4edf8e7523cd", "translation" => "آثار تيديس تقدم شهادة مذهلة على تاريخ وتنوع الحضارات التي نجحت في شمال إفريقيا. هذه القرية البربرية، التي يعود تاريخها إلى العصر النيوليتي، تمتد على مساحة تبلغ 41 هكتارًا وتحتوي على العديد من الكهوف التي كانت مستخدمة في السابق لأغراض طقوس دينية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //470
            ["id" => "76ac2640-ba26-4c39-ab4c-9ec8c45f02e8", "translation" => "The tomb of Massinissa is a remarkable example of architecture that reflects the blend of African and Punic civilization. It is the tomb of the king of Numidia, the founder of the kingdom, and the one who established ancient Cirta as its capital.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5f9c91d7-46a2-4f7c-8f52-72e42fbed352", "translation" => "Le tombeau de Massinissa est un remarquable exemple d'architecture qui témoigne du mélange entre la civilisation africaine et punique. Il s'agit du tombeau du roi de Numidie, fondateur du royaume et ayant établi l'ancienne Cirta comme capitale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6b86434c-54c3-4fdc-89fa-23766581fa73", "translation" => "ضريح ماسينيسا هو مثال رائع على الهندسة المعمارية التي تعكس مزيجًا بين الحضارة الأفريقية والفينيقية. إنه مقبرة ملك نوميديا، مؤسس المملكة، والذي أسس مدينة سيرتا القديمة كعاصمة لها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //471
            ["id" => "80a701db-f8f3-416c-917c-76c97e2a47e1", "translation" => "The Snober Land amusement park is a vibrant and colorful place that offers entertainment for the whole family.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e26b37fd-9a33-46de-a3b8-9948bdf0f46f", "translation" => "Le parc d'attractions Snober Land est un endroit dynamique et coloré qui offre des divertissements pour toute la famille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "37b2d478-383d-4e2a-b17b-7d76e9d19256", "translation" => "حديقة الصنوبر للتسلية هي مكان دينامي وملون يقدم الترفيه لكافة أفراد العائلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //472
            ["id" => "4f315605-bf4c-4913-b421-83f3f039206b", "translation" => "The museum of the Mujahid plays a significant role in educating and raising awareness among the public about the history of Algeria and the struggle for freedom. It helps preserve the collective memory and transmit to future generations the legacy of the Mujahideen, thus emphasizing the importance of resistance and the fight for dignity and national independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5296a8c1-969c-4dea-ba11-a13337122953", "translation" => "Le musée du Moudjahid joue un rôle important dans l'éducation et la sensibilisation du public sur l'histoire de l'Algérie et la lutte pour la liberté. Il contribue à préserver la mémoire collective et à transmettre aux générations futures l'héritage des moudjahidine, rappelant ainsi l'importance de la résistance et du combat pour la dignité et l'indépendance nationale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4618ed1e-1820-419a-8642-efae8825dee6", "translation" => "متحف المجاهد يلعب دورًا هامًا في تثقيف وزيادة الوعي بين الجمهور حول تاريخ الجزائر والنضال من أجل الحرية. إنه يساهم في الحفاظ على الذاكرة الجماعية ونقل إرث المجاهدين إلى الأجيال المستقبلية، مما يؤكد على أهمية المقاومة والكفاح من أجل الكرامة والاستقلال الوطني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //473
            ["id" => "5e4408b3-7dbf-453f-a7a5-4ee9a0475087", "translation" => "The Roman Aqueduct, located near the Boulevard of the Soummam, is an ancient hydraulic structure of significant historical importance. This place is rich in archaeological treasures, including a Numidian necropolis buried in its underground, which deserves further exploration and study.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5d65c0b5-c5fe-452b-91e5-328f63372d8c", "translation" => "L'aqueduc romain, situé à proximité du boulevard de la Soummam, est un ouvrage hydraulique antique d'une grande importance historique. Cet endroit regorge de trésors archéologiques, notamment une nécropole numide enfouie dans ses sous-sols, qui mérite d'être davantage explorée et étudiée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5e80b364-56b1-4886-944a-a9dc0b907e27", "translation" => "القناة الرومانية, الواقع بالقرب من شارع الصومام، هو منشأة هيدروليكية قديمة ذات أهمية تاريخية كبيرة. يحتوي هذا المكان على كنوز أثرية غنية، بما في ذلك مقبرة نوميدية مدفونة تحت سطحه، تستحق استكشافًا ودراسةً أعمق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //474
            ["id" => "a04be468-0405-4447-a3ad-0c77a16d3266", "translation" => "El Meridj park is a peaceful haven offering a green and welcoming space to relax and enjoy nature. Whether for a leisurely walk, a moment of relaxation, or family activities, this park is a preferred meeting place for nature lovers and outdoor enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a715688f-d54f-48b0-b338-7c0120fa9680", "translation" => "Le parc El Meridj est un havre de paix offrant un espace verdoyant et accueillant pour se ressourcer et profiter de la nature. Que ce soit pour une promenade tranquille, une pause détente ou des activités en famille, ce parc est un lieu de rendez-vous privilégié pour les amoureux de la nature et les amateurs de plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f5866dfd-22d3-4cb3-939b-180f2fb74ce6", "translation" => "الحديقة المريج هي ملاذ للسلام تقدم مساحة خضراء ومرحبة للاسترخاء والاستمتاع بالطبيعة. سواء كان الأمر يتعلق بالنزهة الهادئة أو لحظة استراحة أو أنشطة عائلية، تعتبر هذه الحديقة مكانًا مفضلًا لعشاق الطبيعة وعشاق الأنشطة في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //475
            ["id" => "ecac5bf7-f591-4b8a-b58b-1c71a398ffb6", "translation" => "The mausoleum of Quintus Urbicus is an iconic monument in Constantine that reminds us of the close connection between the city's history and its Roman heritage, offering a fascinating glimpse into the region's rich and diverse past.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "85b51cec-a204-41a5-8076-ca5cf113c50a", "translation" => "Le mausolée de Quintus Urbicus est un monument emblématique de Constantine qui rappelle le lien étroit entre l'histoire de la ville et l'héritage romain, offrant ainsi une perspective fascinante sur le passé riche et diversifié de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7c94ddcd-ccb7-4f51-a68b-36825ce5f314", "translation" => "ضريح كوينتوس أوربيكوس هو نصب بارز في قسنطينة يُذكّرنا بالارتباط الوثيق بين تاريخ المدينة وتراثها الروماني، مما يقدم نظرة رائعة إلى الماضي الغني والمتنوع للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //476
            ["id" => "b403bc7c-b3c2-429e-a58e-f2e7fc281887", "translation" => "The Djebel Ouahch park is a true natural gem in Constantine, offering stunning landscapes with its artificial lakes and a forest rich in rare species.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fe79f69b-03c4-4d48-9d6a-b056eef3c6c4", "translation" => "Le parc Djebel Ouahch est un véritable joyau naturel à Constantine, offrant des paysages magnifiques avec ses lacs artificiels et sa forêt regorgeant d'espèces rares.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7c0195b0-9caf-4fe9-97dc-ffcb3443374b", "translation" => "محمية جبل وحش البيولوجية جوهرة طبيعية حقيقية في قسنطينة، حيث يقدم مناظر طبيعية رائعة مع بحيراته الاصطناعية وغابته التي تزخر بأنواع نادرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //477
            ["id" => "b92bb969-5abe-47a2-b81b-b37f36c667ca", "translation" => "Whether to cool off on hot summer days or to enjoy a fun aquatic experience, the Amira land water park provides a pleasant and entertaining setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0da7c870-ed35-4b7e-a0e4-65707d42c204", "translation" => "Que ce soit pour se rafraîchir pendant les chaudes journées d'été ou pour profiter d'une expérience aquatique amusante, le parc aquatique Amira land offre un cadre agréable et divertissant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d9d8f115-36e5-4019-a5a5-b68d3e6931eb", "translation" => "سواءً كنتم ترغبون في التبريد خلال أيام الصيف الحارة أو في الاستمتاع بتجربة مائية ممتعة، تقدم حديقة أميرة لاند المائية إعدادًا لطيفًا وترفيهيًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //478
            ["id" => "0d04dc3c-4c55-4ad4-b601-fc74fbdccc84", "translation" => "The Zenith of Constantine is much more than just a concert hall. It is a dynamic place where artistic training, cultural activities, and opportunities for young talents come together, offering diverse entertainment and contributing to the artistic development of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "88d27159-5f16-4888-9dac-24c7c2e44c53", "translation" => "Le zénith de Constantine est bien plus qu'une simple salle de spectacles. C'est un lieu dynamique où la formation artistique, les activités culturelles et les opportunités pour les jeunes talents se rencontrent, offrant une animation variée et contribuant à l'épanouissement artistique de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b0dfdfe3-a236-40f6-a8b3-2fb14358c2d9", "translation" => "زينيث قسنطينة ليس مجرد قاعة للعروض. إنه مكان حيوي حيث تتقاطع التدريبات الفنية والأنشطة الثقافية والفرص للمواهب الشابة، مما يقدم تنوعًا في الترفيه ويسهم في تنمية الفنون في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //479
            ["id" => "47a13419-1bf1-4753-8e56-2ab198537b36", "translation" => "A pleasant and peaceful space, ideal for relaxing and enjoying nature. The park features expansive lawns where people can take leisurely walks, have picnics, or simply sit and rest.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7c245cdb-d277-419d-81fd-2f62a654fb8a", "translation" => "Un espace agréable et paisible, idéal pour se détendre et profiter de la nature. Le parc est doté de vastes pelouses où les gens peuvent se promener, faire des pique-niques ou simplement s'asseoir et se reposer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d73f3a99-a8a6-46e0-8b6e-37d29fd052b1", "translation" => "مساحة لطيفة وهادئة، مثالية للاسترخاء والاستمتاع بالطبيعة. يتميز الحديقة بمساحة واسعة حيث يمكن للناس القيام بنزهات خارجية، أو ببساطة الجلوس والاستراحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //480
            ["id" => "3b452baf-97cb-4922-b559-85a7304d7c49", "translation" => "The Marina amusement park is a lively and entertaining place that offers a variety of activities that guarantee a good time with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ebda74cd-a0e3-44bd-a7e7-421873e85c3d", "translation" => "Le parc d'attractions Marina est un endroit animé et divertissant qui offre une variété d'activités qui garantissent de passer un bon moment en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "875d58f6-5fed-483a-afb2-3b6456ed6aee", "translation" => "حديقة التسلية مارينا مكان حيوي وممتع يقدم مجموعة متنوعة من الأنشطة التي تضمن قضاء وقت ممتع مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //481
            ["id" => "0fe247e0-6f88-4d0a-9ab9-ed48f9bf06be", "translation" => "The museum of the Mujahid is an iconic place in Mila that pays tribute to the fighters of the national liberation war.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b3007a3f-0235-4e6f-9215-cc700a4c8e14", "translation" => "Le musée du Moudjahid est un lieu emblématique de Mila qui rend hommage aux combattants de la guerre de libération nationale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ddf92201-1335-45b9-9886-92d59135559a", "translation" => "متحف المجاهد هو مكان رمزي في ميلة يكرم مجاهدي حرب التحرير الوطني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //482
            ["id" => "87d1528e-0c4e-4c4f-b7b6-a0a3a2c773fb", "translation" => "The Old Mila is a cultural treasure of great significance, having witnessed many civilizations over the centuries. The site features several ancient remnants that testify to its rich history, including: the Sidi Ghanem mosque, the Roman fountain, remnants of the Byzantine wall, and the city gates. These architectural and historical elements provide visitors with a fascinating glimpse into the city's history and cultural diversity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "59d53f06-2fcc-4822-84b6-e689f06f9484", "translation" => "Le vieux Mila est un trésor culturel d'une grande importance, ayant été le témoin de nombreuses civilisations au fil des siècles. Le site présente plusieurs vestiges anciens qui témoignent de son histoire riche, notamment : La mosquée de Sidi Ghanem, la fontaine romaine, les vestiges de la muraille byzantine, les portes de la ville. Ces éléments architecturaux et historiques offrent aux visiteurs un aperçu fascinant de l'histoire et de la diversité culturelle de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4926df51-c90e-4dd7-9b9f-80e865b55e56", "translation" => "ميلة القديمة هي كنز ثقافي ذو أهمية كبيرة، حيث كانت شاهدة على العديد من الحضارات عبر القرون. يتضمن الموقع العديد من الآثار القديمة التي تشهد على تاريخه الغني، بما في ذلك: جامع سيدي غانم، ونافورة رومانية، وبقايا السور البيزنطي، وأبواب المدينة. تقدم هذه العناصر المعمارية والتاريخية للزوار نظرة مثيرة على تاريخ المدينة وتنوعها الثقافي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //483
            ["id" => "bb0f5906-6775-4b74-b087-8a48fb2fb586", "translation" => "The Grouz hammam is a natural hot spring bath rich in sulfur, located in the heart of a picturesque setting with beautiful landscapes. This place is a true oasis of relaxation and well-being, where visitors can enjoy the benefits of this hot water with sulfur properties.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2617eeee-0f6e-4432-ac20-85068856473b", "translation" => "Le hammam Grouz est un bain d'eau chaude naturelle riche en soufre, situé au cœur d'un cadre pittoresque offrant de magnifiques paysages. Cet endroit est une véritable oasis de détente et de bien-être, où les visiteurs peuvent profiter des bienfaits de cette eau chaude aux propriétés soufrées.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "84261880-9d2a-43ab-a822-83bb0f6249df", "translation" => "حمام ڨروز هو حمّام مياه حارّة طبيعيّة غنيّة بالكبريت، يقع في قلب مناظر خلّابة تقدّم مناظر طبيعيّة رائعة. هذا المكان هو واحة حقيقيّة للاسترخاء والعافية، حيث يمكن للزوّار الاستفادة من فوائد هذه المياه الحارّة ذات الخصائص الكبريتيّة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //484
            ["id" => "44ce36b9-3b15-44b4-8199-e950806767b3", "translation" => "The Agha palace, located in the historic center of Ferdjioua, is a palace with oriental charm. Classified as a national heritage, this site offers a unique experience with its gardens, fountain, and Ottoman architecture.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9c07e9e8-3afb-4db6-bef9-dd9229a86cfa", "translation" => "Le palais de l'Agha, situé dans le centre historique de Ferdjioua, est un palais au charme oriental. Classé patrimoine national, ce site offre une expérience unique avec ses jardins, sa fontaine et son architecture ottomane.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3f097282-af23-4922-8653-5c5b6a60dbaa", "translation" => "قصر الأغا الذي يقع في المركز التاريخي لفرجيوة، هو قصر بسحر شرقي. يُصنف كتراث وطني، ويقدم هذا الموقع تجربة فريدة مع حدائقه ونافورته وهندسته العثمانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //485
            ["id" => "e0b5dcd2-f172-43a3-b712-fdb7b6ce4bfc", "translation" => "The Zaouïa El-Hamlaouia is one of the largest historical zaouïas in Algeria, founded by Sheikh Ali ben Khalifa Al-Hamalaoui. It remains an important place of devotion and gathering for the faithful, and its architecture reflects its historical and cultural significance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "67fc84dc-3d93-4c3c-9816-ef2ada8ac3ae", "translation" => "La zaouïa El-Hamlaouia est l'une des plus grandes zaouïas historiques d'Algérie, fondée par le cheikh Ali ben Khalifa Al-Hamalaoui. Elle reste un lieu important de dévotion et de rassemblement pour les fidèles, et son architecture reflète son importance historique et culturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9e42ba94-9b26-4248-9a80-4dc6fbffa757", "translation" => "الزاوية الحملاوية هي واحدة من أكبر الزوايا التاريخية في الجزائر، تأسست على يد الشيخ علي بن خليفة الحملاوي. إنها تظل مكانًا مهمًا للتفاني والتجمع للمؤمنين، وتعكس معمارها أهميتها التاريخية والثقافية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //486
            ["id" => "73a3265a-8a2a-4de5-a071-62abf3754ae8", "translation" => "The Tamda waterfalls are a breathtaking natural spectacle not to be missed. Nestled in a picturesque setting, these waterfalls offer a magnificent view of water cascading between the rocks, creating a refreshing atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8078c04e-8652-46e1-93e4-f95d82c251c4", "translation" => "Les chutes de Tamda sont un spectacle naturel impressionnant à ne pas manquer. Nichées dans un cadre pittoresque, ces cascades offrent une vue magnifique sur l'eau ruisselant entre les roches et créant une atmosphère rafraîchissante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8436a9f2-8213-4340-b785-8dec2c196bb1", "translation" => "شلالات تامدا مشهد طبيعي رائع يجب ألا يفوته أحد. تقع هذه الشلالات في إطار خلّاب، حيث تقدم منظرًا رائعًا للمياه تتدفق بين الصخور، مما يخلق جوًا منعشًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //487
            ["id" => "5dc65f8a-7d0b-4631-a91d-ec189789fcce", "translation" => "As you walk through this garden, you'll be surrounded by greenery and can enjoy a peaceful and relaxing atmosphere. It's an ideal place for a leisurely stroll or to unwind in nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2fc577bf-f59f-4537-ab9f-fbc1fd9effeb", "translation" => "En vous promenant dans ce jardin, vous serez entouré de verdure et pourrez profiter d'une atmosphère paisible et relaxante. C'est un lieu idéal pour une promenade tranquille ou pour se détendre en pleine nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "df6b53dd-8d63-4009-9052-bf9c5c5a9d3c", "translation" => "بينما تتجول في هذا الحديقة، ستجد نفسك محاطًا بالنباتات ويمكنك الاستمتاع بجو هادئ ومريح. إنه مكان مثالي للنزهة الهادئة أو للاسترخاء في الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //488
            ["id" => "d537818e-9607-4ca0-a1b6-ee2e11043da6", "translation" => "This fountain is an iconic symbol of Setif. It houses a magnificent statue created by the sculptor Francis de Saint-Vidal in 1898. According to local legend, those who drink its water are inevitably drawn to return to it.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a804e141-596e-4fff-acb9-3589b4b34fc3", "translation" => "Cette fontaine est un symbole emblématique de Sétif. Elle abrite une magnifique statue réalisée par le sculpteur Francis de Saint-Vidal en 1898. Selon la légende locale, ceux qui boivent de son eau sont inévitablement attirés pour y revenir.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "71e3f1f9-cb34-4c29-a20a-3c184f49e69a", "translation" => "هذه النافورة رمز مميز في سطيف. إنها تحتوي على تمثال تم إنشاؤه بواسطة النحات فرانسيس دي سانت فيدال في عام 1898. وفقًا للأسطورة المحلية، فإن أولئك الذين يشربون من مياهها لا مفر لهم إلا أن يعودوا إليها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //489
            ["id" => "2e2414bd-fd1e-46c4-b052-ac8623d4ab6d", "translation" => "The Emir Abdelkader garden in Setif is much more than just a park. It is both an ecological and archaeological treasure, offering a unique experience to visitors. In fact, it is considered the city's first lapidary museum.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fb407f40-fbeb-4be2-b400-b59f38fa5b7a", "translation" => "Le jardin de l’Emir Abdelkader est bien plus qu'un simple parc à Sétif. Il est à la fois un trésor écologique et archéologique, offrant une expérience unique aux visiteurs. En effet, il est considéré comme le premier musée lapidaire de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b7875444-cd40-4d99-a64e-1d6e7525386e", "translation" => "حديقة الأمير عبد القادر في سطيف هي أكثر من مجرد حديقة عادية. إنها كنز بيئي وأثري في آن واحد، تقدم تجربة فريدة للزوار. في الواقع، يُعتبر أول متحف معدني في المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //490
            ["id" => "e107a875-4937-4354-b4c5-5b52cda1382f", "translation" => "Upon entering the museum, visitors are transported into the past, immersing themselves in the historical events that shaped the region of Setif. Through well-documented exhibitions, vintage photographs, artifacts, and archival documents, the museum tells the story of Algerian resistance and pays tribute to the heroes of the war of liberation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8edf3465-8704-4fc6-807d-df870ed23a26", "translation" => "En entrant dans le musée, les visiteurs sont transportés dans le passé, plongeant dans les événements historiques qui ont marqué la région de Sétif. À travers des expositions bien documentées, des photographies d'époque, des objets et des documents d'archives, le musée raconte l'histoire de la résistance algérienne et rend hommage aux héros de la guerre de libération.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "accabc36-151e-422f-98cb-38360f93cfd7", "translation" => "عند دخول الزوار إلى المتحف، يتم نقلهم إلى الماضي، حيث يتغمرون في الأحداث التاريخية التي شكلت منطقة سطيف. من خلال معارض موثقة بشكل جيد وصور قديمة وقطع أثرية ووثائق أرشيفية، يروي المتحف قصة المقاومة الجزائرية ويكرم أبطال حرب التحرير.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //491
            ["id" => "9ae8f411-668e-4859-a7c3-59920a4025b9", "translation" => "Whether you are passionate about archaeology, history, or simply curious to explore the past, a visit to the Setif museum will transport you to a fascinating world where echoes of the past still resonate today.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d9803040-8b80-4b32-bee5-42f081d3f273", "translation" => "Que vous soyez passionné d'archéologie, d'histoire ou simplement curieux de découvrir le passé, une visite au Musée de Sétif vous transportera dans un monde fascinant où les échos du passé résonnent encore aujourd'hui.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4e56f8bf-2b1d-4d29-a9f4-d8db12122da0", "translation" => "سواء كنت متحمسًا لعلم الآثار أو التاريخ أو مجرد فضول لاكتشاف الماضي، ستقودك زيارة إلى متحف سطيف إلى عالم رائع حيث تصدى أصداء الماضي لا تزال ترنو فيه اليوم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //492
            ["id" => "10d2c434-68de-4729-bd0f-30d8a4890dab", "translation" => "Whether you're a history enthusiast, an architecture buff, or simply curious to explore new horizons, the Byzantine citadel of Setif is a must-visit location during your trip. It stands as a tangible testament to the ancient might and splendor of the Byzantine civilization in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0e55f00c-a808-4d58-bdf5-b8c577d991a7", "translation" => "Que vous soyez un amateur d'histoire, un passionné d'architecture ou simplement curieux de découvrir de nouveaux horizons, la citadelle byzantine de Sétif est un endroit à ne pas manquer lors de votre visite. C'est un témoignage tangible de l'ancienne puissance et de la splendeur de la civilisation byzantine dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e39fcbb5-3e5c-4085-9f56-7fb2b6b590f6", "translation" => "سواء كنت من عشاق التاريخ أو مجرد فضولي يبحث عن استكشاف عوالم جديدة، فإن القلعة البيزنطية لسطيف مكان يجب زيارته خلال رحلتك. إنه شهادة ملموسة على عظمة وروعة الحضارة البيزنطية القديمة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //493
            ["id" => "6f10ec0b-cd31-47b2-ab57-64eddee8f0ef", "translation" => "The house of culture in Setif is a dynamic and lively place that plays an essential role in the city's cultural life. It is a space dedicated to the promotion of arts, music, theater, and other forms of artistic expression.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ef5ff480-e8aa-4aaa-ab84-38886cc4ac1c", "translation" => "La maison de la culture de Sétif est un lieu dynamique et animé qui joue un rôle essentiel dans la vie culturelle de la ville. C'est un espace dédié à la promotion des arts, de la musique, du théâtre et d'autres formes d'expression artistique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0af1fde3-1599-4bcf-977e-427d8e990be7", "translation" => "دار الثقافة في سطيف مكان حيوي ومفعم بالنشاط يلعب دورًا أساسيًا في الحياة الثقافية للمدينة. إنه مساحة مخصصة لتعزيز الفنون والموسيقى والمسرح وأشكال أخرى من التعبير الفني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //494
            ["id" => "133cf97b-2111-4f1a-91ac-0016794d3c77", "translation" => "The Setif municipal theater is an iconic venue in the city's cultural scene. It's a space dedicated to the performing arts, where theater, dance, music, and other forms of artistic expression come to life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5af66c6b-dc8a-4f65-911b-d51ea3c832ee", "translation" => "Le théâtre municipal de Sétif est un lieu emblématique de la scène culturelle de la ville. C'est un espace dédié aux arts du spectacle, où le théâtre, la danse, la musique et d'autres formes d'expression artistique prennent vie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "864a5826-e850-469b-ab75-3713cf356525", "translation" => "المسرح البلدي سطيف مكان رمزي في المشهد الثقافي للمدينة. إنه مكان مخصص لفنون الأداء، حيث يتجسد المسرح والرقص والموسيقى وأشكال أخرى من التعبير الفني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //495
            ["id" => "71a078c3-eb90-44ee-b3f2-23ca704118ea", "translation" => "Whether you're looking for thrills, wildlife discoveries, or simply a pleasant day out with family, this park is the perfect place. With its diverse attractions, captivating zoo, and friendly atmosphere, it promises you unforgettable memories and shared moments of happiness.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "37a1caaf-64ca-4bfc-a724-34d883e42307", "translation" => "Que vous soyez à la recherche de sensations fortes, de découvertes animalières ou simplement d'une journée agréable en famille, ce parc est l'endroit idéal. Avec ses attractions variées, son zoo captivant et son ambiance conviviale, il vous promet des souvenirs inoubliables et des moments de bonheur partagés.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "88d2bc52-fd41-433a-96cc-a8dfbed1fcf6", "translation" => "سواء كنت تبحث عن التشويقات، أو اكتشاف الحياة البرية، أو مجرد قضاء يوم ممتع مع العائلة، فإن هذا الحديقة هو المكان المثالي. بفضل معالمه المتنوعة، وحديقته الحيوانية المثيرة، وجوه الود والبهجة، يعد لك ذكريات لا تُنسى ولحظات سعادة مشتركة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //496
            ["id" => "92def0b2-3fa8-436a-880b-e45c2851640d", "translation" => "The martyrs' memorial is a place filled with emotions and collective memory. It serves as a reminder of the importance of preserving history and paying tribute to those who sacrificed their lives for justice and freedom.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "949654b8-00dc-47f3-94fc-94b93341bc3c", "translation" => "Le mémorial du martyr est un lieu chargé d'émotions et de mémoire collective. Il rappelle l'importance de préserver l'histoire et de rendre hommage aux personnes qui ont sacrifié leur vie pour la justice et la liberté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ebd9a9c8-0d43-430f-acb4-6a94de61403a", "translation" => "مقام الشهيد هو مكان مليء بالعواطف والذاكرة الجماعية. إنه يعتبر تذكيرًا بأهمية الحفاظ على التاريخ وتقديم العرفان لأولئك الذين قدموا تضحياتهم من أجل العدالة والحرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //497
            ["id" => "84aa4c11-8bd2-4035-be3a-cf14d9aefc99", "translation" => "The public garden is a peaceful and green place where residents and visitors can relax and enjoy nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4bddf851-101b-403e-a7d6-d6faf8e2cf81", "translation" => "Ce jardin public est un lieu paisible et verdoyant où les habitants et les visiteurs peuvent se détendre et profiter de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a5b2b6fa-ff52-4108-abb5-f119d53b88ea", "translation" => "الحديقة العامة هي مكان هادئ وأخضر حيث يمكن للمقيمين والزوار الاسترخاء والاستمتاع بالطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //498
            ["id" => "e4be99eb-7756-408f-ba91-a237d1e13e1b", "translation" => "This museum provides visitors with the opportunity to explore the rich history and archaeological treasures of Djemila. The exhibition rooms are carefully arranged and showcase items such as statues, sculptures, mosaics, pottery, and other artifacts that bear witness to the daily life and art of the Roman era.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "82027a47-6d1f-49bf-b9de-20b715312309", "translation" => "Ce musée offre aux visiteurs l'occasion de découvrir l'histoire riche et les trésors archéologiques de Djemila. Les salles d'exposition sont soigneusement aménagées et mettent en valeur des objets tels que des statues, des sculptures, des mosaïques, des poteries et d'autres artefacts qui témoignent de la vie quotidienne et de l'art de l'époque romaine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e5b80483-0753-4e65-a22a-20c923543f6d", "translation" => "يقدم هذا المتحف للزوار فرصة استكشاف التاريخ الغني والكنوز الأثرية في جميلة. تم ترتيب غرف العرض بعناية وتعرض العديد من العناصر مثل التماثيل والنحت والفسيفساء والفخار والقطع الفنية الأخرى التي تشهد على الحياة اليومية والفن في عصر الرومان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //499
            ["id" => "6c988853-b84d-4ed1-b209-0fa45daedbde", "translation" => "The Roman ruins of Djemila are an exceptional archaeological site that bears witness to the ancient Roman city of Cuicul.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "69f46d32-f948-4efa-a453-05267c1c28dc", "translation" => "Les ruines romaines de Djemila sont un site archéologique exceptionnel qui témoigne de l'ancienne cité romaine de Cuicul.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2d8588c0-e130-42c8-97e6-b1a75a186382", "translation" => "آثار جميلة الرومانية هي موقع أثري استثنائي يشهد على المدينة الرومانية القديمة كويكول.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //500
            ["id" => "7c7c26db-eac4-4fa5-8cb3-ac481f846b00", "translation" => "The Oued el Bared waterfalls are a breathtaking natural spectacle. These waterfalls are a must-visit tourist destination in Setif and are an integral part of the Babors national park. Nature enthusiasts and adventurers will appreciate this getaway in the heart of nature, where they can rejuvenate and connect with the natural environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "24df50f2-ad78-45ac-ad79-aab5dd88aabd", "translation" => "Les chutes de Oued el bared sont un spectacle naturel époustouflant. Ces cascades sont une destination touristique incontournable à Sétif et font partie intégrante du parc national des Babors. Les amateurs de nature et les aventuriers apprécieront cette escapade au cœur de la nature, où ils pourront se ressourcer et se connecter avec l'environnement naturel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7872b62c-0fa3-4809-8083-4ea696f8683e", "translation" => "شلالات واد البارد هي عرض طبيعي رائع. تُعد هذه الشلالات وجهة سياحية لا غنى عنها في سطيف وتعتبر جزءًا لا يتجزأ من حظيرة بابور الوطنية. سيقدر عشاق الطبيعة والمغامرين هذه الزيارة في قلب الطبيعة، حيث يمكنهم الاسترخاء وسط البيئة الطبيعية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //501
            ["id" => "5f1b0409-32bf-42eb-9230-9088a3b217be", "translation" => "By visiting the Hammam Guergour thermal station, visitors can benefit from thermal treatments, relax in hot water pools, and enjoy various health and wellness activities. It's an ideal place to rejuvenate and take care of your body in a preserved natural environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "245f8bee-14f8-4ad3-8064-f6e16912528e", "translation" => "En se rendant à la station thermale de Hammam Guergour, les visiteurs pourront bénéficier des soins et des traitements thermaux, se relaxer dans les piscines d'eau chaude et profiter de diverses activités liées à la santé et au bien-être. C'est un lieu idéal pour se ressourcer et prendre soin de son corps dans un environnement naturel préservé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3b8b796e-734d-4eb0-be58-ccbd7fd71157", "translation" => "بزيارة منتجع حمام ڨرڨور, يمكن للزوار الاستفادة من علاجات حرارية، والاسترخاء في حمامات مياه ساخنة، والاستمتاع بأنشطة متنوعة تتعلق بالصحة والعافية. إنه مكان مثالي للاستجداء والعناية بجسمك في بيئة طبيعية محافظة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //502
            ["id" => "94fdd185-917e-430a-a6ea-8023f8e24c81", "translation" => "Whether for a day of relaxation or a longer stay, Hammam Sokhna thermal resort is the perfect place to rejuvenate and revitalize with the benefits of its natural thermal waters. It's a place where nature, tranquility, and therapeutic benefits come together to provide a unique experience of relaxation and healing.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fcb726ea-3607-4f13-9214-5946b419ea46", "translation" => "Que ce soit pour une journée de détente ou un séjour plus long, la station thermale de Hammam Sokhna est l'endroit idéal pour se ressourcer et se revitaliser grâce aux bienfaits de ses eaux thermales naturelles. C'est un lieu où la nature, la tranquillité et les bienfaits thérapeutiques se conjuguent pour offrir une expérience unique de relaxation et de guérison.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "877fe8cf-ce5c-47ea-a355-1c3a3d1a5d7e", "translation" => "سواء كنت تبحث عن يوم من الاسترخاء أو إقامة أطول، منتجع حمام السخنة هو المكان المثالي للتجدد بفضل فوائدها النافعة من مياهها الحرارية الطبيعية. إنه مكان حيث تتجلى الطبيعة والهدوء والفوائد العلاجية لتقديم تجربة فريدة من الاسترخاء والشفاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //503
            ["id" => "cda861c4-4287-484f-abc8-4f589d6f1cf4", "translation" => "Whether it's for a leisurely stroll, family relaxation, or recreational activities, this park is a welcoming place where everyone can enjoy nature, rejuvenate, and spend quality time outdoors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f73006b6-a00c-4533-94b7-c20c35233842", "translation" => "Que ce soit pour une promenade tranquille, des moments de détente en famille ou des activités récréatives, ce parc est un lieu accueillant où chacun peut profiter de la nature, se ressourcer et passer du temps agréable en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "31b0f194-6f70-4790-ac16-6c71d0d9854f", "translation" => "سواء كنت تبحث عن نزهة هادئة أو لحظات استرخاء مع العائلة أو أنشطة ترفيهية، هذه الحديقة مكان مرحب حيث يمكن للجميع الاستمتاع بالطبيعة، واستعادة النشاط، وقضاء وقت ممتع في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //504
            ["id" => "8296124c-6d46-4e63-abb5-b59ece14a25b", "translation" => "The Mons site offers visitors the opportunity to discover these historical remains, immerse themselves in the atmosphere of the Roman era, and witness the cultural and architectural richness that was once present. It is a fascinating place for archaeology enthusiasts and those curious about the history of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "51befc56-ea59-46d8-8b54-1a96e7e30a10", "translation" => "Le site de Mons offre aux visiteurs l'opportunité de découvrir ces vestiges historiques, de se plonger dans l'atmosphère de l'époque romaine et de témoigner de la richesse culturelle et architecturale qui y était présente. C'est un lieu fascinant pour les passionnés d'archéologie et les curieux de l'histoire de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "19342a3c-cda5-4a63-80d8-4d32003ec5c2", "translation" => "موقع مونس يوفر للزوار فرصة اكتشاف هذه البقايا التاريخية، والانغماس في جو العصور الرومانية، وشهد على الثراء الثقافي والهندسي الذي كان موجودًا في تلك الفترة. إنه مكان رائع لهواة علم الآثار والفضوليين بشأن تاريخ المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //505
            ["id" => "1cbd095e-d553-4da1-9e01-3b70e1c598f2", "translation" => "The Hammam Guergour mausoleum is an enigmatic place whose history remains a mystery. This mausoleum piques the interest and curiosity of visitors who, upon visiting it, can immerse themselves in a mysterious atmosphere and speculate about the possible origins and meanings of this monument.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "48838f4a-6797-45f9-bbaf-c217b8a0899c", "translation" => "Le mausolée de Hammam Guergour est un lieu énigmatique dont l'histoire demeure un mystère. Ce mausolée suscite l'intérêt et la curiosité des visiteurs qui, en le visitant, peuvent se laisser immerger dans une atmosphère mystérieuse et spéculer sur les possibles origines et significations de ce monument.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c180c4f9-bbe2-4715-be73-d339b41bda96", "translation" => "ضريح حمام ڨرڨور هو مكان غامض تبقى تاريخه مجهول. هذا الضريح يثير اهتمام وفضول الزوار الذين، عند زيارته، يمكنهم أن ينغمسوا في جو غامض ويستنتجوا حول أصوله ومعانيه المحتملة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //506
            ["id" => "5802d6ac-e2a0-4e37-8a9c-bccadca0b6b7", "translation" => "The tomb of Scipio the African is one of the many historical remnants inherited from various foreign invasions, particularly that of the Romans. Although relatively unknown to the general public, this funerary tomb holds great historical significance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "efbc408e-8144-4e37-b49d-deb5b08c7724", "translation" => "Le tombeau de Scipion l'Africain est l'un des nombreux vestiges historiques hérités des différentes invasions étrangères, notamment celles des Romains. Bien que relativement méconnu du grand public, ce tombeau funéraire revêt une grande importance historique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6c78f04f-2b4e-4f97-99fc-276428bdb5bf", "translation" => "قبر سيبيون الافريقي هو واحد من الأثار التاريخية العديدة التي ترتبط بالغزو الأجنبي المتعدد، ولا سيما غزو الرومان. على الرغم من أنه غير معروف نسبيًا بين الجمهور العام، إلا أن هذا القبر الجنائزي يحمل أهمية تاريخية كبيرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //507
            ["id" => "8fd7d98a-a6b3-4f61-ac84-3045188c7297", "translation" => "Whether it's to attend a play, a concert, or any other artistic event, the regional theater of el Eulma provides an enriching cultural experience for the locals and visiting guests.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6f0ef0d9-e214-444b-88c6-16fc6c165fa8", "translation" => "Que ce soit pour assister à une pièce de théâtre, un concert ou tout autre événement artistique, le théâtre régional d'El Eulma offre une expérience culturelle enrichissante aux habitants de la région et aux visiteurs de passage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4cb65731-7885-4fee-8367-5de77dd8dc22", "translation" => "سواء كان الأمر يتعلق بحضور عرض مسرحي أو حفل موسيقي أو أي حدث فني آخر، يقدم المسرح الجهوي في العلمة تجربة ثقافية غنية للمحليين والزوار القادمين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //508
            ["id" => "e655930b-b0fb-4b88-a12a-e57ada129c82", "translation" => "A place where one can escape the fast pace of daily life and rejuvenate in nature's embrace. Whether it's for a peaceful stroll, a moment of relaxation, or outdoor activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "29a71984-c028-443c-97e7-4bc3f6a0ee6d", "translation" => "Un endroit où l'on peut échapper au rythme effréné de la vie quotidienne et se ressourcer au contact de la nature. Que ce soit pour une promenade tranquille, un moment de relaxation ou des activités en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "939afa37-111c-44af-8c90-68ad9186cba3", "translation" => "مكان يمكن فيه الهروب من وتيرة الحياة اليومية السريعة واستعادة النشاط عن طريق التواصل مع الطبيعة. سواء كان الأمر يتعلق بالتجول الهادئ أو لحظة استرخاء أو أنشطة خارجية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //509
            ["id" => "1b957b1a-c166-4c54-8529-35a60ea4850a", "translation" => "Whether it's for a peaceful stroll, a jogging session, or just to enjoy the tranquil atmosphere, this park provides a refreshing experience amidst the bustling urban life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "14f477dc-362f-4bfe-9fa9-79c9052e2060", "translation" => "Que ce soit pour une promenade tranquille, une séance de jogging ou simplement pour profiter de l'atmosphère paisible, ce parc offre une expérience rafraîchissante au milieu de la vie urbaine animée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9afd4066-b908-4f29-a98d-bb84d33a33d0", "translation" => "سواء كان الأمر يتعلق بالتجول، أو مجرد الاستمتاع بالجو الهادئ، تقدم هذه الحديقة تجربة منعشة في وسط حياة المدينة الحضرية المزدحمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //510
            ["id" => "9cd45d77-9d08-43c1-869f-f9ab2821af48", "translation" => "It's a place where different types of birds find refuge, including the black-winged stilt and the elegant avocet. Visitors can enjoy the natural beauty of the area and observe the birds. However, it's important to preserve the environment by avoiding pollution. Purification projects are underway to protect this unique site.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f1a4fe59-a81e-4e87-82ab-66ca8ee57916", "translation" => "C'est un lieu où différents types d’oiseaux trouvent refuge, notamment l'échasse blanche et l'avocette élégante. Les visiteurs peuvent profiter de la beauté naturelle de la zone et observer les oiseaux. Cependant, il est important de préserver l'environnement en évitant la pollution. Des projets de purification sont en cours pour protéger ce site unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4a1736b7-d640-488d-84b6-679b6f6fd354", "translation" => "إنه مكان يجد فيه أنواع مختلفة من الطيور مأوىً، يمكن للزوار الاستمتاع بجمال الطبيعة في المنطقة ومشاهدة الطيور. ومع ذلك، من المهم الحفاظ على البيئة عن طريق تجنب التلوث. تُنفَّذ مشاريع تنقية لحماية هذا الموقع الفريد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //511
            ["id" => "09663fe0-395c-40fb-a2ee-532222188282", "translation" => "Bordj el Mokrani is a historic monument dating back to the Turkish era. Today, the fort has been transformed into a museum, allowing visitors to delve into the history of the region and discover its fascinating past.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8c74fab6-0c9e-4d80-90ec-1c8d329004a0", "translation" => "Bordj el Mokrani est un monument historique datant de l'époque turque. Aujourd'hui le fort a été transformé en musée, il permet aux visiteurs de plonger dans l'histoire de la région et de découvrir son passé fascinant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "93a2f1ff-ae5d-4a55-b27c-5d37c9f7602a", "translation" => "برج المقراني هو منصب تاريخي يعود إلى العصر العثماني. اليوم، تم تحويل الحصن إلى متحف، مما يتيح للزوار الغوص في تاريخ المنطقة واكتشاف ماضيها المثير.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //512
            ["id" => "1c19fe9b-d144-4f26-ab9e-f1306b36efab", "translation" => "This statue is a testament to the history and resistance of the region. Visitors can admire it and learn more about the legacy of the uprising by walking around the area.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c5bae4a6-c5a1-47b4-b542-bf85dbea555e", "translation" => "Cette statue est un témoignage de l'histoire et de la résistance de la région. Les visiteurs peuvent l’admirer et en apprendre davantage sur l'héritage de l'insurrection en se promenant dans les environs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "73ac9102-6c07-4561-8322-a61d5287c2a7", "translation" => "هذا التمثال عبارة عن شاهد على تاريخ مقاومة المنطقة. يمكن للزوار أن يعجبوا به ويتعلموا المزيد عن إرث الانتفاضة من خلال التجول في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //513
            ["id" => "b0e8c9e8-2e67-4205-84a3-aed0ddf65570", "translation" => "The May 1st square is a lively and dynamic place, at the heart of urban activity. Surrounded by shops and cafes, it provides a space for meetings and socializing.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b4eae329-23c1-4c0b-977f-c53fabe0fc39", "translation" => "La place du 1er Mai est un lieu animé et dynamique, au cœur de l'activité urbaine. Entourée de commerces et de cafés, elle offre un espace de rencontre et de convivialité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c0aaa2b0-02d2-43b4-a40a-5738a16f0d1d", "translation" => "ساحة 1 ماي هي مكان حيوي وديناميكي، في قلب النشاط الحضري. محاطة بالمحلات التجارية والمقاهي، توفر مساحة للاجتماع والتواصل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //514
            ["id" => "918020da-e91c-4fcd-bf51-eaa0282b7c48", "translation" => "This park is a must-visit for a day filled with adventure, discovery, and fun for all ages. Inside, you'll find thrilling rides, a fascinating zoo housing a variety of exotic animals, and a water park with slides, wave pools, and water attractions.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2bcb4734-4607-4163-b2c6-2e071e031488", "translation" => "Ce parc est un endroit incontournable pour une journée remplie d'aventures, de découvertes et de plaisir pour tous les âges. En son sein, vous trouverez des attractions renversantes, un zoo fascinant, abritant une variété d'animaux exotiques ainsi qu’un aqua parc avec ses toboggans, ses piscines à vagues et ses attractions aquatiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cb033fae-d344-471f-a8b4-fd23f4dbd40a", "translation" => "هذا الحديقة هي وجهة لا غنى عنها لقضاء يوم مليء بالمغامرات والاكتشاف والمرح لجميع الأعمار. في داخلها، ستجد ألعابًا مثيرة وحديقة حيوانات رائعة تضم مجموعة متنوعة من الحيوانات الغريبة، بالإضافة إلى حديقة مائية تحتوي على منزلقات مائية وبرك موج وألعاب مائية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //515
            ["id" => "63e59289-c686-4167-8a50-353af817c45e", "translation" => "The mausoleum of Bordj Chemissa attracts many visitors, both locals and foreigners, who come to admire its ancient architecture and experience its history-laden atmosphere. It's a fascinating place that reflects the rich heritage of the region and is worth exploring.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b1d6e0b9-493c-4981-b869-e716abd24c58", "translation" => "Le mausolée de Bordj Chemissa attire de nombreux visiteurs, qu'ils soient locaux ou étrangers, qui viennent admirer son architecture ancienne et ressentir son atmosphère chargée d'histoire. C'est un lieu fascinant qui témoigne du riche patrimoine de la région et qui mérite d'être découvert.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "89c77401-10e4-48cf-948b-312ab49c76d3", "translation" => "ضريح برج الشميسة يجذب العديد من الزوار، سواء كانوا محليين أم أجانب، الذين يأتون ليعجبوا بعمارته القديمة ويشعروا بأجوائه المحملة بالتاريخ. إنه مكان مثير يعكس التراث الغني للمنطقة ويستحق الاستكشاف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //516
            ["id" => "d9a24bc4-041b-4ae5-be59-e4c8326d1acc", "translation" => "Whether for health reasons or a relaxing getaway, Hammam el Biban is a place of relaxation and healing where visitors can enjoy the benefits of thermal waters and discover the natural beauty of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "03c4ff59-a331-4403-8488-4974a423c14b", "translation" => "Que ce soit pour des raisons de santé ou pour une escapade relaxante, Hammam el Biban est un lieu de détente et de guérison où les visiteurs peuvent profiter des bienfaits des eaux thermales et découvrir la beauté naturelle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5cd3c1e9-c0b4-4e7b-813d-3a0fd5cc958e", "translation" => "سواء كنت تبحث عن أسباب صحية أو تريد الاسترخاء والاستجمام، يعتبر حمّام البيبان مكانًا للراحة والعلاج حيث يمكن للزوار الاستفادة من فوائد المياه الحرارية واكتشاف جمال الطبيعة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //517
            ["id" => "a4ec99cd-65ae-4649-a580-a06296738bb5", "translation" => "Hammam el Main is a popular thermal resort for tourists from different regions of the country seeking relief for various ailments. The waters of this resort are naturally rich in chlorine, sodium, and sulfur, making them beneficial for the treatment of rheumatic and dermatological diseases.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e1586228-2bd9-488b-af26-aa665546d779", "translation" => "Hammam el Main est une station thermale prisée par les touristes venant de différentes régions du pays à la recherche de soulagement pour diverses affections. Les eaux de cette station sont naturellement riches en chlore, sodium et soufre, ce qui les rend bénéfiques pour le traitement des maladies rhumatismales et dermatologiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e4d0bc99-5ef3-4b0a-a4a8-697dc3be7cde", "translation" => "حمّام الماين هو منتجع حراري شهير بين السياح القادمين من مختلف مناطق البلاد الذين يبحثون عن الراحة من مختلف الأمراض. تكون مياه هذا المنتجع غنية طبيعيًا بالكلور والصوديوم والكبريت، مما يجعلها مفيدة لعلاج الأمراض الروماتيزمية والجلدية وغيرها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //518
            ["id" => "e22a4508-152b-4672-821b-57b088d0e135", "translation" => "Formerly just a car alley, it has transformed into a renowned commercial arcade in the region, specializing in the sale of traditional clothing and items. You can also find rare trades there today, such as watchmaking, traditional clothing tailoring, and wool mattress production.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7224c4da-747d-4c24-9a26-b150826d34d0", "translation" => "Autrefois une simple ruelle pour les voitures, il s'est transformé en une arcade commerciale renommée dans la région, spécialisée dans la vente de vêtements et d'objets traditionnels. On y trouve également des métiers aujourd'hui rares, tels que l'horlogerie, la confection d'habits traditionnels et la fabrication de matelas en laine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6a2201ea-754c-47aa-a78c-72c14f403b03", "translation" => "ما كان في السابق مجرد زقاق للسيارات، تحول الآن إلى سوق تجاري مشهور في المنطقة، متخصص في بيع الملابس والأشياء التقليدية. يمكنك أيضًا العثور على حرف نادرة هناك اليوم، مثل صناعة الساعات وخياطة الملابس التقليدية وإنتاج فراش الصوف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //519
            ["id" => "875c5408-055e-407f-b709-8c0620cd4ba4", "translation" => "Whether you're a history enthusiast, a student, or just curious, a visit to the museum of the Mujahid in Bordj Bou Arreridj allows you to explore an essential part of Algeria's history and pay tribute to the heroes of the national liberation war.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1d93144d-4e3a-489a-8638-303ee7d70307", "translation" => "Que l'on soit passionné d'histoire, étudiant ou simple curieux, une visite au musée du Moudjahid de Bordj Bou Arreridj permet de découvrir un pan essentiel de l'histoire de l'Algérie et de rendre hommage aux héros de la guerre de libération nationale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "567a47b8-a294-449d-965a-8908a28c75c9", "translation" => "سواء كنت مهتمًا بالتاريخ أو طالبًا أو مجرد فضولي، زيارة متحف المجاهد في برج بوعريريج تتيح لك اكتشاف جزء أساسي من تاريخ الجزائر وتقديم الاحترام لأبطال حرب التحرير الوطني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //520
            ["id" => "2a9dcebd-9721-44bc-a954-96a4e80aa68d", "translation" => "Visiting the mosque of Ouled Sidi Brahim, visitors are captivated by its ancient architecture and the richness of its history. It is a place of spirituality, education, and the transmission of religious and cultural values. The mosque bears witness to the inhabitants' attachment to their identity and heritage, as well as the harmonious coexistence between Arabic and Tamazight, the two languages present in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "17e8c2b5-bfc0-4e2b-ac70-ad9cc8e15a4f", "translation" => "En visitant la mosquée de Ouled Sidi Brahim, les visiteurs sont fascinés par son architecture ancienne et la richesse de son histoire. C'est un lieu de spiritualité, d'éducation et de transmission des valeurs religieuses et culturelles. La mosquée témoigne de l'attachement des habitants à leur identité et à leur héritage, ainsi qu'à la coexistence harmonieuse entre l'arabe et le tamazight, les deux langues présentes dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "69e7cfc9-bd74-471b-ae1a-4ec9d9c80b21", "translation" => "عند زيارة مسجد أولاد سيدي إبراهيم، يُفتن الزوار بعمارته القديمة وثراء تاريخه. إنه مكان للروحانية والتعليم ونقل القيم الدينية والثقافية. يشهد الجامع على ارتباط سكان المنطقة بهويتهم وتراثهم، وكذلك على التعايش السلمي بين اللغة العربية والأمازيغية، اللغتين اللتين موجودتين في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //521
            ["id" => "a4f4f5ef-8c4d-41d0-97ff-873e9b6cc692", "translation" => "The place exudes great serenity and grandeur, accentuated by the beauty of the surrounding nature and the configuration of the terrain. All these characteristics provide the Khabib Ibn Uday mosque with strong potential for the development of a tourist product that combines cultural tourism and nature exploration.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bca41805-0843-43d0-b22a-14aad9b27354", "translation" => "L'endroit dégage une grande sérénité et une majestuosité, accentuées par la beauté de la nature environnante et la configuration du relief. Toutes ces caractéristiques confèrent à la mosquée Khabib Ibn Uday un fort potentiel pour le développement d'un produit touristique alliant tourisme culturel et découverte de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "50cfed4c-e4b3-4173-8592-674ab5fa2aa6", "translation" => "المكان ينبعث منه هدوء كبير وسُمية، مُعزّزًا بجمال الطبيعة المحيطة وتكوين التضاريس. توفر جميع هذه الخصائص مسجد خبيب بن عدي إمكانات قوية لتطوير منتج سياحي يجمع بين السياحة الثقافية واستكشاف الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //522
            ["id" => "da6290c4-077c-4da1-b2ec-877a864606dd", "translation" => "Right in the midst of a semi-arid environment lies a magnificent landscape that starkly contrasts with the harsh surroundings: the Ain Legradj waterfalls. These waterfalls, standing at a height of around twenty meters, are fed by clear and cool springs converging on a cliff.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "92cc37b9-aaff-452e-a9a3-83cc1104d566", "translation" => "En plein dans un environnement semi-aride se trouve un paysage somptueux qui contraste avec l'environnement hostile qui l'entoure : les chutes de aïn Legradj. Ces chutes, d'une hauteur d'une vingtaine de mètres, sont alimentées par des sources limpides et fraîches qui convergent sur une falaise.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "317da396-da8f-4745-b24a-d0c07dc16d40", "translation" => "في وسط بيئة نصف جافة تكمن مناظر طبيعية رائعة تتناقض بشكل كبير مع البيئة القاسية المحيطة بها: شلالات عين لقراج. هذه الشلالات، بارتفاع يبلغ نحو عشرين مترًا، تتغذى من ينابيع واضحة وباردة تتقاءم على حافة صخرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //523
            ["id" => "154ade09-3594-4ed4-bdd4-ce2be60ceae4", "translation" => "In addition to its rich vegetation, the Mzita forest also offers picturesque landscapes, with a beautiful sunset that lights up the sky in the evening. This preserved natural environment is a true haven of peace where visitors can enjoy moments of relaxation and leisure in the heart of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c7ef0555-a56a-4853-8f4b-d1597608dd52", "translation" => "En plus de sa richesse végétale, la forêt de Mzita offre également des paysages pittoresques, avec un magnifique coucher de soleil qui illumine le ciel en fin de journée. Cet environnement naturel préservé constitue un véritable havre de paix où les visiteurs peuvent profiter de moments de détente et de loisirs en pleine nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5675a92c-59c7-4d56-bd2a-d5355f999059", "translation" => "بالإضافة إلى ثرائها النباتي، تقدم غابة مزيطة مناظر طبيعية خلابة، مع غروب شمس جميل يضيء السماء في المساء. هذا البيئة الطبيعية المحافظة هي ملاذ حقيقي للسلام حيث يمكن للزوار الاستمتاع بلحظات الاسترخاء والترفيه في قلب الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //524
            ["id" => "9637b68a-e1f2-4d3f-9a5c-949bd04636fc", "translation" => "The tomb of Takfarinas is a historically significant site. It is the burial place of the famous berber leader Takfarinas, who played a major role in resisting Roman occupation in the 1st century AD.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9be469eb-edbe-49e4-aeb9-dd8727ace59d", "translation" => "Le tombeau de Takfarinas est un site historique d'une grande importance. Il s'agit du lieu de sépulture du célèbre chef berbère Takfarinas, qui a joué un rôle majeur dans la résistance contre l'occupation romaine au 1er siècle après J-C.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2884ff45-4b30-4acc-8591-6a56e0f68091", "translation" => "مقبرة تاكفاريناس هي موقع تاريخي ذو أهمية كبيرة. إنها مكان دفن الزعيم الأمازيغي الشهير تاكفاريناس، الذي لعب دورًا كبيرًا في مقاومة الاحتلال الروماني في القرن الأول الميلادي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //525
            ["id" => "43b716da-8333-4e2a-9b35-f0c45e031ddf", "translation" => "The Errich recreational forest is an ideal place to escape the stress of daily life, reconnect with nature, and enjoy a day of outdoor leisure. Whether for hiking, picnicking, or simply relaxing in the shade of the trees, this place offers a pleasant experience for all nature lovers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3a085c94-0dff-43f8-b784-be215cdbdc0c", "translation" => "La forêt récréative d'Errich est un lieu idéal pour échapper au stress de la vie quotidienne, se reconnecter avec la nature et profiter d'une journée de loisirs en plein air. Que ce soit pour une randonnée, un pique-nique ou simplement se détendre à l'ombre des arbres, cet endroit offre une expérience agréable pour tous les amoureux de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "99c70276-31c0-4223-b74b-3d237fb0aa2b", "translation" => "غابة الريش مكان مثالي للهروب من ضغوط الحياة اليومية، وإعادة الاتصال بالطبيعة، والاستمتاع بيوم في الهواء الطلق. سواء كان ذلك للمشي لمسافات طويلة، أو للنزهات، أو ببساطة الاسترخاء في ظل الأشجار، يقدم هذا المكان تجربة ممتعة لجميع عشاق الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //526
            ["id" => "7b8085f2-2af7-4663-a2da-139712382497", "translation" => "Bordj Hamza is a living testament to Bouira's past and is a site of interest for history enthusiasts, architecture aficionados, and curious individuals seeking cultural discoveries.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b3c2e61b-9d66-4397-80d4-a4f4ab4038d0", "translation" => "Bordj Hamza est un témoignage vivant du passé de Bouira et constitue un site d'intérêt pour les amateurs d'histoire, les passionnés d'architecture et les curieux en quête de découvertes culturelles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9ef40719-4027-4684-960c-2e4164f9bb53", "translation" => "برج حمزة هو شاهد حي على ماضي بويرة ويعتبر موقعًا يثير اهتمام عشاق التاريخ وعشاق العمارة والفضوليين الباحثين عن اكتشافات ثقافية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //527
            ["id" => "9359f82c-d26d-4fee-86d6-e34945da4d0e", "translation" => "This wall bears witness to the history and significance of the city of Auzia, with its three main gates still standing today. These gates are constructed in the typical fashion of Roman cities, with a latin cross-shaped design.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7b374d10-1b17-422b-b27b-406e4b7e0da8", "translation" => "Cette muraille témoigne de l'histoire et de l'importance de la ville d'Auzia, avec ses trois portes principales toujours présentes aujourd'hui. Ces portes sont construites selon la structure typique des villes romaines, avec une forme en croix latine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "776903c1-55c6-4c13-be06-3ba7952fb704", "translation" => "هذا الجدار يشهد على تاريخ وأهمية مدينة أوزيا، حيث تظل ثلاثة أبواب رئيسية للمدينة موجودة حتى اليوم. تم بناء هذه الأبواب وفقًا للتصميم النموذجي للمدن الرومانية، بتصميم على شكل صليب لاتيني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //528
            ["id" => "2594e8e2-bb3c-4862-8bda-c439d829eb9c", "translation" => "The Faraksen thermal station is a thermal site located in the heart of the Kessana forest. Since antiquity, it has been frequented by spa-goers seeking well-being and relaxation, drawn by the high flow of the spring and its therapeutic properties.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "08eda1a6-e27f-46a5-a372-878978070fff", "translation" => "La station thermale Faraksen est un site thermal situé au cœur de la forêt de Kessana. Depuis l'Antiquité, il est très fréquenté par les curistes à la recherche de bien-être et de repos, attirés par le haut débit de la source et ses vertus thérapeutiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "183568ff-3f2d-4053-81ea-fb97f709082d", "translation" => "منتجع فراكسن هي منتجع حراري يقع في قلب غابة كسانة. منذ العصور القديمة، تمتلئ بالزوار الذين يبحثون عن الرفاهية والاسترخاء، مجذوبين بالتدفق العالي للينابيع وفوائدها العلاجية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //529
            ["id" => "e9e054cf-807e-42de-96d6-4fef45df2ca5", "translation" => "The center is responsible for organizing tourist, leisure, and outdoor activities for young people and other users. It promotes the organization of various sports, artistic, and cultural events, and makes its facilities available to the public for sports, educational, recreational, and large-scale competitive activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4057ff5a-5d63-4a13-b6f3-4bb9f050a750", "translation" => "Le centre est chargé d'organiser des activités touristiques, de loisirs et de plein air pour les jeunes et autres utilisateurs. Il encourage l'organisation de divers événements sportifs, artistiques et culturels, et met ses installations à la disposition du public pour la pratique sportive, éducative, récréative et compétitive à grande échelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e370d007-16bd-4ec3-a53c-f81f6b161787", "translation" => "المركز مسؤول عن تنظيم الأنشطة السياحية والترفيهية والخارجية للشباب والمستخدمين الآخرين. يشجع على تنظيم مختلف الفعاليات الرياضية والفنية والثقافية ويضع منشآته تحت تصرف الجمهور لممارسة الأنشطة الرياضية والتعليمية والترفيهية والمنافسات الكبيرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //530
            ["id" => "4ec71394-dced-4667-a2d0-10ab1985a28f", "translation" => "The Tikjda museum is a place that highlights the richness and diversity of the fauna, flora, and natural heritage of the region. Located in the heart of the Djurdjura national park, the museum offers visitors the opportunity to discover and appreciate the exceptional biodiversity of this protected area.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0f31dd3e-f9e0-4463-93f0-d8368f344dae", "translation" => "Le musée de Tikjda est un lieu qui met en valeur la richesse et la diversité de la faune, de la flore et du patrimoine naturel de la région. Situé au cœur du parc national du Djurdjura, le musée offre aux visiteurs l'opportunité de découvrir et d'apprécier la biodiversité exceptionnelle de cette zone protégée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d7877946-05c6-4886-b476-30a2f728cdc1", "translation" => "متحف تيكجدة هو مكان يسلط الضوء على ثراء وتنوع الحياة البرية والنباتية والتراث الطبيعي في المنطقة. يقع المتحف في قلب حظيرة جرجرة الوطنية، ويقدم للزوار فرصة اكتشاف وتقدير التنوع البيولوجي الاستثنائي لهذه المنطقة المحمية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //531
            ["id" => "067e7308-eb96-4b04-bd11-8bbf1cbde0c6", "translation" => "These waterfalls are a popular gathering place for nature lovers, hikers, and photographers looking to capture the magic of this landscape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "124b1d15-c309-4cfe-8d62-5522eb3635d0", "translation" => "Ces chutes d'eau sont un lieu de rendez-vous populaire pour les amoureux de la nature, les randonneurs et les photographes qui cherchent à capturer la magie de ce paysage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "099b2218-a2e2-48ea-b5b5-7a49f3923593", "translation" => "هذه الشلالات هي مكان تجمع شهير بين عشاق الطبيعة، والمتنزهين، والمصورين الذين يبحثون عن التقاط سحر هذا المنظر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //532
            ["id" => "b9166d2a-e694-4f1f-8e33-45f64399d63d", "translation" => "In addition to its peaceful surroundings, the Dounya park offers attractions for the younger ones. Children can have fun on colorful playgrounds, enjoy age-appropriate swings, and slide down the slides with laughter and joy. These playful activities make the park an entertainment spot for the whole family.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "12f137d2-66d5-44b9-8059-54915b180557", "translation" => "En plus de ses aménagements paisibles, le parc Dounya offre des attractions pour les plus jeunes. Les enfants peuvent s'amuser sur les aires de jeux colorées, profiter des balançoires adaptées à leur âge et dévaler les toboggans en riant de joie. Ces activités ludiques font du parc un lieu de divertissement pour toute la famille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "03ab6353-edcc-4f3b-b09b-356f10ef1afd", "translation" => "بالإضافة إلى بيئته الهادئة، تقدم حديقة دونيا معالم جذب للأطفال الصغار. يمكن للأطفال الاستمتاع بألعاب والاستفادة من الأرجوحات المناسبة لأعمارهم، والانزلاق على الزحاليق مع الضحك والفرح. تلك الأنشطة المرحة تجعل من الحديقة مكانًا للترفيه لجميع أفراد العائلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //533
            ["id" => "655b13c8-8bab-4c40-bc43-854e8811955a", "translation" => "Despite the current absence of activities, the open-air theater in Bouira remains a beacon of hope for the creativity and artistic expression of the region. It eagerly awaits the start of live performances to delight the audience and provide moments of entertainment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "551eb76e-ad4a-414f-8a51-b5735fbdf65e", "translation" => "Malgré l'absence d'activités actuelles, le théâtre en plein air de Bouira reste un espoir pour la créativité et l'expression artistique de la région . Il attend avec impatience le début des spectacles vivants pour ravir le public et offrir des moments de divertissement et de réflexion.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bb2c9175-19c4-4229-a807-79cc85a9d54c", "translation" => "على الرغم من غياب الأنشطة حاليا، يظل المسرح المفتوح في بويرة أملاً للإبداع والتعبير الفني للمنطقة. إنه ينتظر بفارغ الصبر بدء العروض المباشرة لإسعاد الجمهور وتقديم لحظات من الترفيه والتأمل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //534
            ["id" => "9585e657-cbcc-4eea-bed4-f73a2c81e077", "translation" => "An iconic venue dedicated to promoting culture and the arts in the region. Located in the heart of the city, it plays a central role in the cultural life of the local community.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3db752df-6ba1-4867-be58-0a289919f7f3", "translation" => "Un lieu emblématique consacré à la promotion de la culture et des arts dans la région. Située au cœur de la ville, elle joue un rôle central dans la vie culturelle de la communauté locale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "13e482d5-54ce-428a-bc4f-23f6f9142b9e", "translation" => "مكان رمزي مكرس لتعزيز الثقافة والفنون في المنطقة. يقع في قلب المدينة، وهو يلعب دورًا مركزيًا في الحياة الثقافية للمجتمع المحلي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //535
            ["id" => "189bd447-52b2-432c-b0d5-a9a1c21bd1e2", "translation" => "In addition to its practical function, the Tilesdit dam also provides a picturesque landscape with its calm waters and natural surroundings. It serves as a place of relaxation and recreation for the local residents, offering opportunities for fishing, boating, and other recreational activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4896cf61-5443-4265-b227-8015c895bde2", "translation" => "Au-delà de sa fonction pratique, le barrage de Tilesdit offre également un paysage pittoresque avec ses eaux calmes et son environnement naturel. Il constitue un lieu de détente et de loisirs pour les habitants de la région, offrant des opportunités de pêche, de navigation et d'autres activités récréatives.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "18085c91-7669-487b-a3c8-568239ebdf2f", "translation" => "بالإضافة إلى وظيفته العملية، سد تلسديت يقدم أيضًا مناظر طبيعية خلابة مع مياهه الهادئة ومحيطه الطبيعي. إنه مكان للاسترخاء والترفيه لسكان المنطقة المحليين، حيث يوفر فرصًا لصيد الأسماك وغيرها من الأنشطة الترفيهية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //536
            ["id" => "09f7f317-3e37-4824-8c50-922b4f26d12d", "translation" => "In addition to its functional utility, the Koudiat Acerdoune dam offers a striking landscape characterized by its imposing retaining wall and calm waters that stretch over a vast area. Visitors can relax and enjoy themselves by exploring the tranquil waters of the dam while admiring the natural beauty of this environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "46fe95d2-9501-4ea5-8004-4a6183953194", "translation" => "En plus de son utilité fonctionnelle, le barrage de Koudiat Acerdoune présente un paysage saisissant, caractérisé par son imposant mur de retenue et ses eaux calmes qui s'étendent sur une vaste surface. Les visiteurs peuvent ainsi se détendre et se divertir en explorant les eaux paisibles du barrage, tout en admirant la beauté naturelle de cet environnement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d7e6ee85-e783-4cf3-9811-43017dad5cd3", "translation" => "بالإضافة إلى فائدته الوظيفية، يقدم سد كدية أسردون مناظر طبيعية رائعة تتميز بجدار الاحتجاز الضخم والمياه الهادئة التي تمتد على مساحة واسعة. يمكن للزوار بذلك الاسترخاء والتمتع بأنفسهم من خلال استكشاف المياه الهادئة للسد مع التعرف على جمال هذه البيئة الطبيعية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //537
            ["id" => "6c31d233-12f8-41f9-8806-f9322a8ad128", "translation" => "This enchanting place provides an ideal setting for water and recreational activities enthusiasts. Whether you are passionate about fishing or simply seeking tranquility, this magical place will meet all your expectations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cb8bde6d-74d4-4483-9f1d-5dee56b5f465", "translation" => "Cet endroit enchanteur offre un cadre idéal pour les amateurs d'activités nautiques et récréatives. Que vous soyez passionné de pêche ou simplement en quête de tranquillité, ce lieu magique répondra à toutes vos attentes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "aee438bc-862e-46a7-881e-233f249f1fa0", "translation" => "هذا المكان الساحر يوفر بيئة مثالية لهواة الأنشطة المائية والترفيه. سواء كنت مهووسًا بصيد الأسماك أو مجرد البحث عن الهدوء، سيتلبي هذا المكان الساحر كل توقعاتك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //538
            ["id" => "ef4cfdeb-7783-4044-9454-99e5cb1d0c47", "translation" => "The leisure park in Blida is the perfect place to spend quality time with family or friends. Whether you're looking to engage in sports, relax, or enjoy good food, this park provides everything you need for a pleasant and memorable day.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "18b64cd9-4d16-4ab7-8b97-678cd7cf564f", "translation" => "Le parc de loisirs de Blida est l'endroit idéal pour passer du temps de qualité en famille ou entre amis. Que vous cherchiez à faire du sport, à vous détendre ou à savourer une bonne cuisine, ce parc vous offre tout ce dont vous avez besoin pour passer une journée agréable et mémorable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "25c12f02-1c3f-4388-a869-ca9f91bd432f", "translation" => "حديقة الترفيه في البليدة هي المكان المثالي لقضاء وقت ذو جودة مع العائلة أو الأصدقاء. سواء كنت تبحث عن ممارسة الرياضة أو الاسترخاء أو الاستمتاع بوجبة طعام لذيذة، تقدم هذه الحديقة كل ما تحتاجه لقضاء يوم ممتع وذكريات جميلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //539
            ["id" => "1db38d70-4ddd-4c65-b85e-a91bb2d1d47e", "translation" => "The Patrice Lumumba garden is an ideal place for a peaceful stroll, contemplative break, or simply to rejuvenate in nature. Whether it's to enjoy a moment of solitude, spend time with family, or admire the beauty of the surroundings, this garden offers a tranquil and invigorating experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "89865b3f-6362-40bd-8d7f-67a6d73cbc88", "translation" => "Le jardin Patrice Lumumba est un endroit idéal pour une promenade tranquille, une pause contemplative ou simplement pour se ressourcer en pleine nature. Que ce soit pour profiter d'un moment de solitude, pour se retrouver en famille ou pour admirer la beauté des lieux, ce jardin offre une expérience paisible et revigorante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "33724197-37f4-4cfb-b7c3-e3fb52b207f0", "translation" => "حديقة باتريس لومومبا هي مكان مثالي للنزهة الهادئة، أو لاستراحة تأملية، أو ببساطة لاستعادة النشاط في الطبيعة. سواء كنتم تتمتعون بلحظات الوحدة، أو تقضون وقتًا مع العائلة، أو تعجبون بجمال المكان، تقدم هذه الحديقة تجربة هادئة ومجددة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //540
            ["id" => "26e9eb6c-fb96-4b6d-b9b7-78469e0d0c09", "translation" => "The Mohamed V garden is an iconic meeting and gathering place for the residents of Blida, who come to enjoy this peaceful space for strolling, relaxing, or simply spending time with family and friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cbfe385c-f3ee-48d6-b5a1-4558a123344b", "translation" => "Le jardin Mohamed V est un lieu emblématique de rencontre et de rassemblement pour les habitants de Blida, qui viennent profiter de cet espace tranquille pour se promener, se détendre ou simplement passer du temps en famille et entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ad29fce0-e900-4d3e-a235-7daeb1c8a64b", "translation" => "حديقة محمد الخامس هي مكان رمزي للاجتماع والتجمع لسكان البلدة ، الذين يأتون للاستمتاع بهذا المكان الهادئ للتجول والاسترخاء أو ببساطة قضاء وقت مع العائلة والأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //541
            ["id" => "58bb26d7-a777-485a-a227-a01f061bb7f6", "translation" => "This square is the vibrant heart of the city of Blida, a central and iconic square that embodies the essence of local life and history. Surrounded by historic and commercial buildings, it is a true cultural and social crossroads.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "842dc97f-0e19-420c-a4be-7d85ad896311", "translation" => "Cette place est le cœur vibrant de la ville de Blida, une place centrale et emblématique qui incarne l'essence de la vie et de l'histoire locale. Entourée de bâtiments historiques et commerçants, elle est un véritable carrefour culturel et social.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "477b8b11-c8fe-48cb-8423-27a766a91a8a", "translation" => "هذه الساحة هي قلب مدينة البليدة، ساحة مركزية ورمزية تجسد جوهر الحياة والتاريخ المحلي. محاطة بالمباني التاريخية والتجارية، إنها ملتقى حقيقي للحياة الثقافية والاجتماعية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //542
            ["id" => "5d23b441-9042-4f4e-9400-428bbcc589a2", "translation" => "The museum of the mujahid in Blida is a place of memory and commemoration. It pays tribute to the heroes of the war of independence and preserves the collective memory of the Algerian people.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3846c164-cd6d-4cf2-8e35-ced34b9fbb74", "translation" => "Le musée du Moudjahid de Blida est un lieu de mémoire et de commémoration. Il rend hommage aux héros de la guerre d'indépendance et préserve la mémoire collective du peuple algérien.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c422b29b-6abe-4a87-aa51-29643ddaff8a", "translation" => "متحف المجاهد في البليدة هو مكان للذاكرة والاحتفال. إنه يكرم أبطال حرب الاستقلال ويحتفظ بالذاكرة الجماعية للشعب الجزائري.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //543
            ["id" => "53f5e579-8c29-44ab-b1ee-22edbb7566f8", "translation" => "The chamber of crafts and trades is a dynamic place dedicated to the promotion and preservation of traditional trades and local craftsmanship. This institution plays an essential role in supporting and fostering artisans and craft trades in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "25a76509-b6d8-449d-998e-12f4c3fdff1f", "translation" => "La chambre de l'artisanat et des métiers est un lieu dynamique dédié à la promotion et à la préservation des métiers traditionnels et de l'artisanat local. Cette institution joue un rôle essentiel dans le soutien et le développement des artisans et des métiers artisanaux de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2cedff53-2686-48ed-85bd-e1c73172afab", "translation" => "غرفة الصناعة والحرف هي مكان دينامي مخصص للترويج والحفاظ على الحرف التقليدية والحرف اليدوية المحلية. تلعب هذه المؤسسة دورًا أساسيًا في دعم وتطوير الحرفيين والصناعات اليدوية في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //544
            ["id" => "ed38e02a-aaa8-4bbe-a127-a6dd4a1c13a5", "translation" => "Oued el Fentas is a must-visit destination in Blida. Its natural beauty, combined with a peaceful and relaxing atmosphere, makes it a cherished place for both locals and visitors seeking tranquility and serenity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "214ad8a0-056d-4a87-9d09-a4f51e9a04a7", "translation" => "Oued el Fentas est une destination incontournable à Blida. Sa beauté naturelle, associée à une ambiance paisible et relaxante, en fait un lieu apprécié par les habitants locaux et les visiteurs en quête de tranquillité et de sérénité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1381db45-5ae6-466d-abc2-dcefd806cdc2", "translation" => "واد الفنطاس وجهة لا غنى عنها في البليدة. جماله الطبيعي، بالإضافة إلى أجوائه الهادئة والمريحة، يجعله مكانًا محببًا للسكان المحليين والزوار الذين يبحثون عن الهدوء والسكينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //545
            ["id" => "f2916227-e2e6-4b3a-88f5-dd0e23b93a75", "translation" => "The Chrea national park is a natural wonder that attracts nature enthusiasts and hiking enthusiasts. This park, spanning a vast expanse, is characterized by spectacular mountain landscapes, dense forests, and rich biodiversity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3111a07a-f566-4467-a2e2-e070485caf32", "translation" => "Le parc national de Chréa est une merveille naturelle qui attire les amoureux de la nature et les amateurs de randonnée. Ce parc, qui s'étend sur une vaste étendue, est caractérisé par des paysages montagneux spectaculaires, des forêts denses et une biodiversité riche.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "74586371-8c61-406b-9baf-cb1e7a52b725", "translation" => "الحظيرة الوطنية للشريعة هو عجب طبيعي يجذب عشاق الطبيعة وعشاق رياضة المشي لمسافات طويلة. يتميز هذا المتنزه، الذي يمتد على مساحة واسعة، بمناظر جبلية رائعة وغابات كثيفة وتنوع بيئي غني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //546
            ["id" => "5e00025c-0f56-40ed-9497-0e7bef7658fe", "translation" => "The Martyrs' monument is a commemorative site dedicated to the heroes and martyrs who sacrificed their lives for the independence and freedom of Algeria. It is located at the entrance of the city and consists of steles bearing the names of the deceased.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "39a56c19-e0d4-4a53-8d27-f52c0af15075", "translation" => "Le monument aux martyrs est un lieu de commémoration dédié aux héros et aux martyrs qui ont sacrifié leur vie pour l'indépendance et la liberté de l'Algérie. Il est situé à l’entrée de la ville et se compose de stèles portant les noms des défunts.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6b8688c8-3bd1-44d2-8b19-c28d2178b3ad", "translation" => "مقام الشهيد موقع تذكاري مخصص لأبطال وشهداء قدموا تضحياتهم من أجل استقلال وحرية الجزائر. يقع عند مدخل المدينة ويتألف من ألواح تحمل أسماء الشهداء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //547
            ["id" => "ff4f38ef-12f7-44ac-8dd6-f588b1129a94", "translation" => "The Hammam Melouane thermal spa is a haven of relaxation and well-being. Nestled in the heart of lush nature, it provides an ideal setting to recharge and enjoy the benefits of thermal waters.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a28be0a5-40b5-45ed-a5a0-afea53ecfa21", "translation" => "La station thermale de Hammam Melouane est un havre de détente et de bien-être. Nichée au cœur d'une nature luxuriante, elle offre un cadre idéal pour se ressourcer et profiter des bienfaits des eaux thermales.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "21c9f928-ea32-4b5a-bdd0-0d01ed436761", "translation" => "منتجع حمّام ملوان هو ملاذ للاسترخاء والرفاهية. يُعتبر مكنسة في قلب طبيعة خضراء فاخرة، ويوفر بيئة مثالية للتجديد والاستفادة من فوائد الينابيع الحرارية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //548
            ["id" => "498b1bc1-6cf5-49ff-9a0b-d7dc027d73c5", "translation" => "The museum provides an immersive experience where visitors can discover the diversity of the fauna, flora, and ecosystems that characterize Chrea national park.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "795ba822-1a66-4ac8-be43-6aa6a163682b", "translation" => "Le musée offre une expérience immersive où les visiteurs peuvent découvrir la diversité de la faune, de la flore et des écosystèmes qui caractérisent le parc national de Chréa.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a61ab5a4-7c89-4542-ba90-0ac6105faf89", "translation" => "المتحف يقدم تجربة غامرة حيث يمكن للزوار اكتشاف تنوع الحياة البرية والنباتات والنظم البيئية التي تميز حظيرة شريعة الوطنية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //549
            ["id" => "f9c29caf-d3fc-473a-9fe1-a259ac84ba7c", "translation" => "The black forest gets its name from the density of its trees, which rarely allow sunlight to pass through, creating an atmosphere that is both serene and mysterious. This forest is primarily composed of cedars, providing an ideal refuge for many animals such as jackals, foxes, and wild boars.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "02b73dcc-c960-4b57-9d96-32eb1fc3b62e", "translation" => "La forêt noire tire son nom de la densité de ses arbres, qui laissent rarement passer les rayons du soleil, créant ainsi une atmosphère à la fois calme et mystérieuse. Cette forêt est principalement constituée de cèdres, offrant un refuge idéal à de nombreux animaux tels que les chacals, les renards et les sangliers.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a0360497-8923-49e7-92e3-540db439692a", "translation" => "تُعرف الغابة السوداء بمسماها بفضل كثافة أشجارها، التي نادرًا ما تسمح لأشعة الشمس بالمرور، مما يخلق جوًا هادئًا وغامضًا في نفس الوقت. تتكون هذه الغابة أساسًا من أشجار الأرز، مما يوفر مأوى مثاليًا للعديد من الحيوانات مثل الذئاب والثعالب والخنازير البرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //550
            ["id" => "04063d35-988a-42b1-99a2-335b427da871", "translation" => "The Chiffa gorges offer visitors an unforgettable experience. The breathtaking landscapes, tumultuous waterfalls, and the richness of the fauna and flora make this place a true natural and historical treasure.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "40abeca3-3c0d-4d67-8513-2099575605cd", "translation" => "Les gorges de la Chiffa offrent aux visiteurs une expérience inoubliable. Les paysages à couper le souffle, les cascades tumultueuses et la richesse de la faune et de la flore font de cet endroit un véritable trésor naturel et historique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "904ab807-aeb8-40ab-ab83-d426714fcd45", "translation" => "مضائق الشفة تقدّم للزوّار تجربة لا تُنسى. المناظر الطبيعية الرائعة، والشلالات الجارفة، وثراء الحياة البرية والنباتات يجعلون هذا المكان كنزًا طبيعيًا وتاريخيًا حقيقيًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //551
            ["id" => "28fff5ce-7554-41f5-a2eb-4d22814fb9fd", "translation" => "Whether you are a nature lover, a fishing enthusiast, a hiker, or simply in search of a peaceful place to relax, the Bouroumi dam promises you a unique panorama.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "08b2da03-9d26-478e-a058-c7ffac9a71a7", "translation" => "Que vous soyez un amoureux de la nature, un passionné de pêche, de randonnée ou simplement en quête d'un lieu paisible pour vous détendre, le barrage de Bouroumi vous promet un panorama unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f375d990-df8a-471e-8e93-9bf241e7fcaf", "translation" => "سواء كنت عاشقًا للطبيعة، أو عاشقًا للصيد، أو متسلقًا، أو ببساطة تبحث عن مكان هادئ للاسترخاء، يعد سد بورومي لك إطلالة فريدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //552
            ["id" => "39caa47a-a259-4796-a319-73faa4b5b1a0", "translation" => "The Kerrache waterfalls offer a true natural sanctuary of exceptional beauty. What makes these waterfalls so unique is the freshness of their crystal-clear waters and the adventurous path that leads to them.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "08a03233-4405-4bbc-9388-9af1ff10d74c", "translation" => "Les cascades de Kerrache offrent un véritable refuge naturel d'une beauté exceptionnelle. Ce qui rend ces cascades si uniques, c'est la fraîcheur de leurs eaux cristallines et le chemin aventureux qui mène jusqu'à elles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "574f0ccd-14fd-4ae9-8241-bc5cbeb5b0d3", "translation" => "شلالات الكراش تقدم مأوى طبيعي حقيقي من جمال استثنائي. ما يجعل هذه الشلالات فريدة من نوعها هو نقاء مياهها الصافية والمسار المغامر الذي يؤدي إليها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //553
            ["id" => "10b0b6f8-f547-4f74-a44f-9740f2246355", "translation" => "This haven of tranquility provides an ideal natural setting to rejuvenate and reconnect with the beauty of nature. Visitors can stroll along the peaceful shores of the lake, enjoy the serene atmosphere that prevails, and observe the wildlife and vegetation flourishing in this small, preserved ecosystem.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4e0b3c26-88cb-491d-ae58-5fc752c851ad", "translation" => "Ce havre de tranquillité offre un cadre naturel idéal pour se ressourcer et se reconnecter à la beauté de la nature. Les visiteurs peuvent se promener le long des rives paisibles du lac, profiter de l'atmosphère sereine qui y règne et observer la vie animale et végétale qui s'épanouit dans ce petit écosystème préservé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d83b9529-0c3e-4036-b87b-e445af42e308", "translation" => "هذا الملاذ للهدوء يقدم إطاراً طبيعياً مثالياً للتجديد وإعادة الاتصال بجمال الطبيعة. يمكن للزوار التجول على طول شاطئ البحيرة الهادئة، والاستمتاع بالأجواء الهادئة التي تسودها، ومشاهدة الحياة البرية والنباتات التي تزدهر في هذا النظام البيئي الصغير المحفوظ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //554
            ["id" => "76c79004-76c6-4fe3-b46c-4bae01dc06fa", "translation" => "The Emir Abdelkader's residence, transformed into a museum, serves as a true testament to the history and heritage of Medea. Visitors can thus explore this unique cultural space and immerse themselves in the authentic atmosphere of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1b570a2f-17a6-47e0-8e39-072fd2c88dc6", "translation" => "La demeure de l'Émir Abdelkader, transformée en musée, constitue un véritable témoignage de l'histoire et du patrimoine de Médéa. Les visiteurs peuvent ainsi explorer cet espace culturel unique et se plonger dans l'atmosphère authentique de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "124aae26-6a2b-4e42-9e3e-6f1fc14d2ce3", "translation" => "إقامة الأمير عبد القادر، التي تم تحويلها إلى متحف، تشكل شاهدًا حقيقيًا على تاريخ وتراث مدينة المدية. يمكن للزوار بذلك استكشاف هذا الفضاء الثقافي الفريد والانغماس في الجو الأصيل للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //555
            ["id" => "c6259660-804a-47ee-9c1f-1ea9beb796d3", "translation" => "Visitors can explore the various facets of the struggle for independence, from the initial stages of mobilization to the declaration of Algeria's independence. The museum highlights the courage, determination, and sacrifice of the men and women who participated in this fight for freedom.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "859bb843-3b61-48f2-a020-a4f6e4351f27", "translation" => "Les visiteurs peuvent découvrir les différents aspects de la lutte pour l'indépendance, depuis les premières étapes de la mobilisation jusqu'à la proclamation de l'indépendance de l'Algérie. Le musée met en valeur le courage, la détermination et le sacrifice des hommes et des femmes qui ont participé à cette lutte pour la liberté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8abbc4f4-5718-4a26-84ce-f97481c2d5e8", "translation" => "يمكن للزوار استكشاف جوانب مختلفة من النضال من أجل الاستقلال، من مراحل الحشد الأولى حتى إعلان استقلال الجزائر. يسلط المتحف الضوء على شجاعة وإصرار وتضحيات الرجال والنساء الذين شاركوا في هذا النضال من أجل الحرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //556
            ["id" => "e1c5749c-999d-4dd2-b1b7-03e9b83b6b81", "translation" => "While the open-air theater may lack recent performances, it still retains its atmosphere and artistic potential. Local actors, musicians, and artists are invited to rediscover this exceptional venue and bring its stage to life, thus providing the audience with unforgettable moments.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "248b1da7-3046-4c8a-9c6f-5e37f8e4d5bb", "translation" => "Bien que le théâtre en plein air puisse manquer de représentations récentes, il conserve toute son atmosphère et son potentiel artistique. Les acteurs, musiciens et artistes locaux sont invités à redécouvrir ce lieu exceptionnel et à donner vie à sa scène, offrant ainsi au public des moments inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2411b96f-832f-4c38-a8a8-3c96fec10d02", "translation" => "على الرغم من أن المسرح المفتوح يمكن أن يفتقد عروضًا حديثة، إلا أنه لا يزال يحتفظ بجوه وإمكانياته الفنية. يتم دعوة الممثلين والموسيقيين والفنانين المحليين إلى إعادة اكتشاف هذا المكان الاستثنائي وإعطاء حياة لخشبته، مما يقدم للجمهور لحظات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //557
            ["id" => "372f4084-ff29-4823-8154-4e2b9241dec8", "translation" => "The archaeological site of Achir was once an ancient city that served as the first capital of the muslim berber dynasty of the Zirids, under the suzerainty of the Fatimids. This site bears witness to the historical significance of this ancient city and provides visitors with the opportunity to explore the remains of its fascinating past.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8c5921dc-fa73-404a-974c-0cc3dcd6e1af", "translation" => "Le site archéologique d'Achir était autrefois une ancienne ville qui servait de première capitale de la dynastie berbère musulmane des Zirides, sous la suzeraineté des Fatimides. Ce site témoigne de l'importance historique de cette ancienne cité et offre aux visiteurs la possibilité d'explorer les vestiges de son passé fascinant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bc257df6-0982-49f4-b80e-79294ab78c73", "translation" => "موقع أشير الأثري كان فيما مضى مدينة قديمة كانت تعتبر أول عاصمة لسلالة الزيريين البربرية المسلمة، تحت سيطرة الفاطميين. يشهد هذا الموقع على أهمية هذه المدينة القديمة من الناحية التاريخية ويمنح الزوار الفرصة لاستكشاف آثار ماضيها الرائع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //558
            ["id" => "8fb654fc-5680-4e4b-a167-5d924112afbd", "translation" => "Though modest, the Ksar Boukhari amusement park provides a pleasant and entertaining break for families seeking recreational activities in the region. It's a place where one can enjoy a few hours of fun and adventure to brighten up their day.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "be607186-af47-45cd-81ea-4a6273434a51", "translation" => "Bien que modeste, le parc d'attractions de Ksar Boukhari offre une pause agréable et divertissante pour les familles en quête d'activités récréatives dans la région. C'est un lieu où l'on peut profiter de quelques heures de plaisir et d'aventure pour égayer sa journée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b917fb1d-5d3f-4679-a569-57f7a8a64214", "translation" => "على الرغم من بساطته، يقدم متنزه الألعاب في قصر بوخاري فترة استراحة ممتعة ومسلية للعائلات الباحثة عن أنشطة ترفيهية في المنطقة. إنه مكان يمكن للزوار الاستمتاع فيه ببضع ساعات من المرح والمغامرة لإضفاء بهجة على يومهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //559
            ["id" => "4540bf4e-67d1-4486-a376-cd9547b26579", "translation" => "The statue of the Virgin Mary, nestled in a peaceful and serene setting, is a testament to the profound spirituality that permeates the area.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "44e3fc40-ebbf-45ae-9888-5624e235dec1", "translation" => "La statue de la Vierge Marie, nichée dans un cadre paisible et serein, est un témoignage de la spiritualité profonde qui imprègne les lieux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e738e1bd-1aee-4528-bedd-e8b4d417a43e", "translation" => "تمثال السيدة العذراء مريم, الموجود في إطار هادئ وساكن، هو شهادة على الروحانية العميقة التي تملأ المكان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //560
            ["id" => "edd7840a-3914-4d1f-8c0a-892184bf5d67", "translation" => "The Tibhirine monastery has a rich history dating back to the 12th century when Cistercian monks established their community there. It is known for its simple and authentic architectural style, blending Christian influence with local berber architecture harmoniously.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fd9141a3-82c8-424e-ac1c-1de31ce7af62", "translation" => "Le monastère de Tibhirine a une histoire riche qui remonte au XIIe siècle, lorsque des moines cisterciens y ont établi leur communauté. Il est connu pour son style architectural sobre et authentique, mêlant harmonieusement l'influence chrétienne et l'architecture berbère locale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "327d6b8b-440c-4b72-899f-ce89aab6c850", "translation" => "دير تيبحيرين له تاريخ غني يعود إلى القرن الثاني عشر، عندما أسس رهبان سيسترسيين مجتمعهم هناك. يُعرف الدير بأسلوبه المعماري البسيط والأصيل، الذي يجمع بين التأثير المسيحي والهندسة المعمارية البربرية المحلية بانسجام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //561
            ["id" => "1fa8e678-a7e2-462d-9216-ce6d89151b83", "translation" => "The Zonday waterfalls offer a unique and captivating experience in the heart of nature, where one can admire the power of water and rejuvenate in a beautiful setting. It's a place deserving of preservation and respect for future generations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4b48cd14-8055-4297-97ee-a1d9d6a69bf3", "translation" => "Les cascades de Zonday offrent une expérience unique et fascinante au cœur de la nature, où l'on peut admirer la force de l'eau et se ressourcer dans un cadre magnifique. C'est un lieu qui mérite d'être préservé et respecté pour les générations futures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8755d668-545e-40de-885b-40fa5f70d6c0", "translation" => "شلالات زونداي تقدم تجربة فريدة وجذابة في قلب الطبيعة، حيث يمكن للزائرين أن يعجبوا بقوة المياه ويجددوا نشاطهم في إطار جميل. إنه مكان يجب الحفاظ عليه واحترامه للأجيال القادمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //562
            ["id" => "42a2e0f7-fa02-4ca0-b615-0cfb257dc268", "translation" => "The crafts square is a dynamic place where one can discover local craftsmanship, enjoy entertainment, dine, and appreciate the surrounding nature. It is a must-visit spot for culture and discovery enthusiasts during their visit to Medea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "419ce3f5-f922-48ff-a799-2edf453eecc1", "translation" => "La place de l'artisanat est un lieu dynamique où l'on peut découvrir l'artisanat local, se divertir, se restaurer et profiter de la nature environnante. C'est un endroit incontournable pour les amateurs de culture et de découverte lors de leur passage à Médéa.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8109cdec-0ee1-4da3-9b0b-21ee2dc792e9", "translation" => "ساحة الحرف والصناعات هي مكان دينامي حيث يمكن للزوار اكتشاف الحرفية المحلية، والاستمتاع بالترفيه، وتناول وجبة، والتمتع بالطبيعة المحيطة. إنها مكان لا غنى عنه لعشاق الثقافة والاكتشاف أثناء زيارتهم إلى مدينة المدية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //563
            ["id" => "3f0bbbf3-2cf6-4b6f-944d-aa4709a56ccc", "translation" => "The archaeological site of Rapidum houses the ruins of an ancient military fort built by the Romans during the first century of their rule in Mauritania. This fort aimed to strengthen Roman control and extend their dominance into the interior of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ca61a50b-ccb6-4bfe-90ef-857ce9cb5e7d", "translation" => "Le site archéologique de Rapidum abrite les ruines d'un ancien fort militaire construit par les Romains au cours du premier siècle de leur domination en Maurétanie. Ce fort avait pour objectif de renforcer le contrôle et d'étendre la domination romaine dans l'intérieur de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ac5b56f7-f667-4cac-9989-a6ba8afec318", "translation" => "الموقع الأثري لرابيدوم يحتضن آثار حصن عسكري قديم بُني من قبل الرومان خلال القرن الأول من حكمهم في موريتانيا. كان هذا الحصن يهدف إلى تعزيز السيطرة الرومانية وتوسيع سيطرتهم في داخل المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //564
            ["id" => "f1eff007-df04-4a34-ac43-42fdfb321028", "translation" => "Haouch el Bey is a unique architectural masterpiece that beautifully combines Maghrebian and Oriental styles. This residence, once used as a winter retreat for the Bey and his family, is a testament to the history and culture of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8e649df3-d333-43f2-af1f-6bc6ca026d69", "translation" => "Haouch el Bey est un chef-d'œuvre architectural unique qui allie magnifiquement le style maghrébin et oriental. Cette résidence, autrefois utilisée comme lieu de villégiature pour le Bey et sa famille pendant l'hiver, est un témoignage de l'histoire et de la culture de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c0af34c3-3b18-4fba-895e-49585d3854fd", "translation" => "حوش الباي هو تحفة معمارية فريدة تجمع بجمال بين الأسلوب المغربي والشرقي. هذه الإقامة، التي كانت مستخدمة في السابق كمكان للاستجمام للباي وعائلته خلال فصل الشتاء، هي شهادة على تاريخ وثقافة المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //565
            ["id" => "6886ce1c-07f6-46d6-9ef1-70441ac9ccdd", "translation" => "The Medea aqueduct is a remarkable ancient hydraulic structure dating back to the 2nd century BC. It was designed to convey water to the military garrison of the city of 'Lambdia' at the time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a4a1be10-b973-482f-96c4-5e071ad1be94", "translation" => "L'aqueduc de Médéa est un remarquable ouvrage hydraulique antique qui remonte au IIe siècle avant Jésus-Christ. Il était conçu pour acheminer l'eau vers la garnison militaire de la ville de 'Lambdia' à l'époque.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b6559a85-f7a6-4d8b-95db-c4de54c72133", "translation" => "القناة المائية لمدينة المدية هي منشأة هيدروليكية تاريخية بارزة تعود إلى القرن الثاني قبل الميلاد. تم تصميمها لنقل المياه إلى الحصن العسكري في مدينة 'لامبديا' في ذلك الوقت.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //566
            ["id" => "8b922cda-ef87-4ed5-b656-6cd9671bfe4d", "translation" => "By visiting this museum, visitors have the opportunity to better understand the significance of Lalla Fatma Nsoumer in the struggle for independence and to pay tribute to her legacy. It is a place filled with emotion and national pride, reminding us of the courage and determination of this prominent figure in the resistance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8fb97782-edd9-4563-a6c9-9640b1c2d90b", "translation" => "En visitant ce musée, les visiteurs ont l'occasion de mieux comprendre l'importance de la figure de Lalla Fatma Nsoumer dans la lutte pour l'indépendance et de rendre hommage à son héritage. C'est un lieu empreint d'émotion et de fierté nationale, rappelant le courage et la détermination de cette grande figure de la résistance.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e344fb15-8e9a-451a-bb12-5b583b2d8b42", "translation" => "من خلال زيارة هذا المتحف، يتاح للزوار فرصة فهم أفضل لأهمية شخصية لالة فاطمة نسومر في النضال من أجل الاستقلال وتقديم الاحترام لتراثها. إنه مكان مليء بالعاطفة والفخر الوطني، يُذكّرنا بشجاعة وإصرار هذه الشخصية البارزة في مسار المقاومة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //567
            ["id" => "ef79e570-4bb7-4536-897f-bdd497ce7e00", "translation" => "The chamber of crafts and trades is a place dedicated to the promotion and preservation of local artisanal crafts. It also provides a conducive space for interaction between artisans and visitors interested in traditional craftsmanship.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6906de97-ccb6-48b6-8d18-be64df1a6eb0", "translation" => "La chambre de l'artisanat et des métiers est un lieu dédié à la promotion et à la préservation des métiers artisanaux locaux. Elle offre également un espace propice à la rencontre entre les artisans et les visiteurs intéressés par l'artisanat traditionnel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b47c5a8e-310e-4852-ad5e-be4a0d36b746", "translation" => "غرفة الحرف والصناعات هي مكان مخصص للترويج والحفاظ على الصناعات الحرفية المحلية. كما توفر أيضًا مساحة مناسبة للتفاعل بين الحرفيين والزوار الذين يهتمون بالحرف التقليدية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //568
            ["id" => "50b99f3b-a4c9-4dad-84df-306e3d57f269", "translation" => "El Nour mosque is a place that inspires serenity and contemplation. Its harmonious design and unique architectural features capture the attention of visitors. The interior of the mosque provides a conducive space for prayer and meditation, with decorative elements that reflect the beauty of Islamic art.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "324b5929-89dc-4396-8491-4dbbef6a176e", "translation" => "La mosquée el Nour est un endroit qui inspire la sérénité et la contemplation. Son design harmonieux et ses caractéristiques architecturales uniques attirent l'attention des visiteurs. L'intérieur de la mosquée offre un espace propice à la prière et à la méditation, avec des éléments décoratifs qui reflètent la beauté de l'art islamique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "91beb79e-8648-4326-8183-88b0cb1c7684", "translation" => "مسجد النور هو مكان يلهم السكينة والتأمل. تصميمه المتناغم وملامحه المعمارية الفريدة تجذب انتباه الزوار. داخل الجامع يوفر مساحة مناسبة للصلاة والتأمل، مع عناصر ديكورية تعكس جمال الفن الإسلامي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //569
            ["id" => "cecb21ad-ed6a-40d5-ac9a-23304fa601e2", "translation" => "The November 1st square is a visual landmark and a meeting point for residents and tourists. It reflects the identity and vitality of the city and serves as a vibrant hub of life in the heart of Medea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7b701c13-172c-44fc-a030-2f81d6bf00fe", "translation" => "La place du 1er Novembre est un point de repère visuel et un lieu de rendez-vous pour les habitants et les touristes. Elle témoigne de l'identité et de la vitalité de la ville, et constitue un espace de vie et de convivialité au cœur de Médéa.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "60c1723f-9de3-420d-8feb-c79d8e1e012b", "translation" => "ساحة 1 نوفمبر 1954 هي علامة بصرية مميزة ومكان اجتماع للسكان والسياح. إنها تعكس هوية وحيوية المدينة، وتشكل مركزًا حيويًا للحياة والتواصل في قلب مدينة المدية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //570
            ["id" => "2cb3aa22-bf1d-49b3-8de6-0560cf99b73e", "translation" => "The fort holds significant historical importance as it was used by Emir Abdelkader as a barracks for his troops during the period of resistance against the French occupation. In addition to serving as a military base, Emir Abdelkader also developed industrial facilities within the fort. A powder manufacturing factory and firearm production workshops were established.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b0c98fb6-5292-4fbf-b611-e66e8000a822", "translation" => "Le fort revêt une grande importance historique, car il a été utilisé par l'Émir Abdelkader comme casernement pour ses troupes lors de la période de résistance contre l'occupation française. En plus de servir de base militaire, l'Émir Abdelkader a également développé des installations industrielles à l'intérieur du fort. Une usine de fabrication de poudre ainsi que des ateliers de fabrication d'armes à feu ont été érigés.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d2ef3c59-237d-4fd6-a5e5-590a15f1ee54", "translation" => "الحصن يحمل أهمية تاريخية كبيرة، حيث تم استخدامه من قبل الأمير عبد القادر كثكنة لقواته خلال فترة المقاومة ضد الاحتلال الفرنسي. بالإضافة إلى دوره كقاعدة عسكرية، قام الأمير عبد القادر أيضًا بتطوير منشآت صناعية داخل الحصن، حيث تم إنشاء مصنع للبارود وورش لتصنيع الأسلحة النارية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //571
            ["id" => "2831ef62-62c4-44ed-ad62-3cc7fde6ecab", "translation" => "The watchtower is a historical monument dating back to the Ottoman era. It served as a residence for the guards of Bey Mustapha Boumezrag and was even used by the French for capital executions, earning it the local nickname 'the guillotine.'", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e80c5da8-3a4e-48cd-8df4-bbc22f2780ea", "translation" => "La tour de guet un monument historique qui remonte à l'époque ottomane. Elle a servi de lieu de résidence pour la garde du Bey Mustapha Boumezrag et a même été utilisée par les Français pour des exécutions capitales, donnant lieu au surnom local de 'la guillotine'.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "347a3d0c-6592-46ed-a18d-e2f57f121a05", "translation" => "برج المراقبة هو من معالم التاريخ تعود إلى العصر العثماني. وقد استُخدم كمكان إقامة لحراس الباي مصطفى بومزراق وحتى تم استخدامه من قبل الفرنسيين لتنفيذ عمليات إعدام، مما أدى إلى لقبه المحلي بـ 'المقصلة'.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //572
            ["id" => "48fe3e59-04da-4827-95a8-21d661e36f87", "translation" => "Whether you're a hiking enthusiast, enjoy outdoor picnics, or simply seeking a moment of peace and tranquility, the Ben Chicao forest is the perfect place to escape and reconnect with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5dff9795-0ec0-41b2-a04a-3cba69bc75f7", "translation" => "Que vous soyez amateur de randonnée, de pique-nique en plein air ou simplement à la recherche d'un moment de calme et de tranquillité, la forêt de Ben Chicao est l'endroit idéal pour vous évader et vous reconnecter avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8d0dc6f3-4733-4bb6-b9ec-43be39cf5ba7", "translation" => "سواء كنت عاشقًا لرياضة المشي، أو تستمتع بنزهات في الهواء الطلق، أو مجرد البحث عن لحظة من السكينة والهدوء، فإن غابة بن شكاو هي المكان المثالي للاستمتاع والابتعاد عن الضجة وإعادة الاتصال بالطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //573
            ["id" => "adf919db-c3da-4ab3-9a08-fa0abb33f48e", "translation" => "As a major cultural institution, the cultural center plays an essential role in promoting cultural and artistic activities in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "461f1df7-61eb-4c23-aa7e-5a1aad0a2006", "translation" => "En tant qu'institution culturelle majeure, la maison de la culture joue un rôle essentiel dans la promotion des activités culturelles et artistiques dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "00bd193e-b7d6-4b17-a4f1-77435ef0bae6", "translation" => "بوصفها مؤسسة ثقافية رئيسية، تلعب دار الثقافة دوراً أساسياً في تعزيز الأنشطة الثقافية والفنية في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //574
            ["id" => "9b0b1b46-b157-4c4f-8022-1a038aae355d", "translation" => "Beyond its significance for wildlife and flora, the Boughezoul lake also holds exceptional tourist and recreational potential. Whether you're a nature enthusiast, an ornithologist, or simply seeking a peaceful place to relax, the Boughezoul dam is sure to charm you.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c330a469-c040-4dff-8981-79826f84d911", "translation" => "Au-delà de son importance pour la faune et la flore, le lac de Boughezoul possède également un potentiel touristique et récréatif exceptionnel. Que vous soyez passionné de nature, d'ornithologie ou simplement à la recherche d'un lieu paisible pour vous ressourcer, le barrage de Boughezoul saura vous séduire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6f6d91c7-c85d-4e19-b3b3-a4502cc6a6f0", "translation" => "بالإضافة إلى أهميته للحياة البرية والنباتات، تمتلك بحيرة بوغزول أيضًا إمكانية استثنائية للسياحة والترفيه. سواء كنت عاشقًا للطبيعة، أو عالِم بيئي، أو مجرد بحثٍ عن مكان هادئ للاسترخاء، فإن سد بوغزول سيكون لديه القدرة على سحرك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //575
            ["id" => "e33b4e0f-857f-4e6f-89cf-f152a5e6f32f", "translation" => "The Ouled Mellouk dam is an imposing hydraulic structure that offers a captivating panorama. It is also a place for leisure and relaxation, where visitors can engage in water activities such as fishing, boating, and water sports.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b10360ed-5955-485c-9ad0-81e2bc989667", "translation" => "Le barrage Ouled Mellouk est une imposante infrastructure hydraulique qui offre un panorama captivant. Il est également un lieu de loisirs et de détente, où les visiteurs peuvent pratiquer des activités nautiques telles que la pêche, la navigation de plaisance et les sports nautiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bf342672-eb78-4239-8393-c883496c3bed", "translation" => "سد أولاد ملوك هو منشأة هيدروليكية تقدم منظرًا جذابًا. إنه أيضًا مكان للترفيه والاسترخاء، حيث يمكن للزوار ممارسة أنشطة مائية مثل الصيد وركوب الزوارق ورياضات الماء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //576
            ["id" => "ead526a0-21d4-4755-a9e2-331621f69332", "translation" => "By visiting this museum, you will be transported back in time. You will also discover the weapon manufacturing techniques used at the time, as well as the evolution of these techniques over time. Interactive exhibitions and demonstrations will immerse you in the weapon-making process and help you better understand their significance in the region's history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "68c319ba-efff-4bb5-9b42-10bfbbeb1236", "translation" => "En visitant ce musée, vous serez transporté dans le temps. Vous découvrirez également les techniques de fabrication d'armes utilisées à l'époque, ainsi que l'évolution de ces techniques au fil du temps. Des expositions interactives et des démonstrations vous plongeront dans le processus de fabrication des armes et vous permettront de mieux comprendre leur importance dans l'histoire de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0f2f1a26-d258-45d7-9c4d-53e0532ad2b4", "translation" => "بزيارة هذا المتحف، ستنقل إلى الوراء في الزمن. ستكتشف أيضًا تقنيات تصنيع الأسلحة المستخدمة في تلك الحقبة، وكذلك تطور هذه التقنيات مع مرور الوقت. المعارض التفاعلية والعروض التوضيحية ستغمرك في عملية تصنيع الأسلحة وتساعدك على فهم أهميتها في تاريخ المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //577
            ["id" => "ab5ac347-8541-45fa-a299-04690a4f94b9", "translation" => "Whether you're a history enthusiast, a culture buff, or simply curious to learn more about Emir Abdelkader, this museum will captivate you. It's a place that honors the memory of a great leader and provides visitors with a precious opportunity to delve into the past and gain a better understanding of Algeria's history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7722485b-6e3f-4138-b4a7-1979972e6351", "translation" => "Que vous soyez un amateur d'histoire, un passionné de culture ou simplement curieux d'en apprendre davantage sur l'Émir Abdelkader, ce musée saura vous captiver. C'est un lieu qui honore la mémoire d'un grand leader et qui offre aux visiteurs une occasion précieuse de plonger dans le passé et de mieux comprendre l'histoire de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9f06380c-048b-466d-a838-75be79732ad3", "translation" => "سواء كنت عاشقًا للتاريخ أو عاشقًا للثقافة أو مجرد فضولي للتعرف على المزيد عن الأمير عبد القادر، سيكون هذا المتحف مُسَحَّرًا بالنسبة لك. إنه مكان يكرم ذكرى قائد عظيم ويقدم للزوار فرصة ثمينة للغوص في الماضي وفهم أفضل لتاريخ الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //578
            ["id" => "8be9b895-b416-4a74-8428-5910dbbb7581", "translation" => "Whether you're looking for a moment of tranquility, a pleasant stroll, or a playground for children, this garden is the perfect place to relax and connect with nature in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1b8df08a-d4b0-4db2-ab83-365f4a0e5610", "translation" => "Que vous soyez à la recherche d'un moment de tranquillité, d'une promenade agréable ou d'un espace de jeux pour les enfants, Ce jardin est l'endroit parfait pour se ressourcer et se connecter avec la nature en plein cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "37d4cc9f-755e-4a01-9188-ec069683fd80", "translation" => "سواء كنت تبحث عن لحظة من الهدوء، أو نزهة ممتعة، أو مكان للعب للأطفال، هذه الحديقة هي المكان المثالي للاسترخاء والتواصل مع الطبيعة في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //579
            ["id" => "4aad1bea-8394-4ec4-bfb2-0158d57d2ae7", "translation" => "Whether it's for swimming laps, having family fun, or simply enjoying a sunny day by the water, the municipal pool of Miliana is the perfect place to cool off and have a great time during the summer months.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d44a298f-eb24-47a1-943e-3253668aa67f", "translation" => "Que ce soit pour faire quelques longueurs, s'amuser en famille ou simplement profiter d'une journée ensoleillée au bord de l'eau, la piscine municipale de Miliana est l'endroit idéal pour se rafraîchir et passer du bon temps pendant les mois d'été.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4b88b681-0529-469d-9289-9ec61fa5f84d", "translation" => "سواء كنت ترغب في السباحة أو الاستمتاع بوقت ممتع مع العائلة أو مجرد الاستمتاع بيوم مشمس على حافة الماء، يعد مسبح بلدية مليانة المكان المثالي للانتعاش وقضاء وقت ممتع خلال أشهر الصيف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //580
            ["id" => "f308b0e6-deb3-443c-840e-66e5ba1103ac", "translation" => "Despite its state of ruins,the Alexandre Michalet castle remains a symbol of Miliana's history and heritage. Its preservation and enhancement can help to remind of its past significance and raise awareness among visitors about the importance of architectural heritage conservation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "22907063-238f-4459-b16d-c75140a7f9dc", "translation" => "Malgré son état de ruine, le Château Alexandre Michalet reste un symbole de l'histoire et du patrimoine de Miliana. Sa préservation et sa mise en valeur peuvent contribuer à rappeler son importance passée et à sensibiliser les visiteurs à l'importance de la conservation du patrimoine architectural.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4aa3433b-75b8-48b0-86ff-f25a83d4cdd4", "translation" => "على الرغم من حالتها المتداعية، يظل قصر ألكساندر ميشالي رمزًا لتاريخ مليانة وتراثها. يمكن أن تسهم المحافظة عليه وتعزيزه في تذكير الناس بأهميته في الماضي وزيادة الوعي لدى الزوار بأهمية الحفاظ على التراث المعماري.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //581
            ["id" => "567044a9-b1ab-445b-8090-88d0ece116f7", "translation" => "While the original mosque was demolished in 1856 to make way for the city's development, the minaret was preserved and transformed into a clock tower. It is now a central landmark in Miliana, located near the house of Emir Abdelkader.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8257a7d1-69ec-4fd8-be94-831d2d1866d1", "translation" => "Bien que la mosquée d'origine ait été détruite en 1856 pour laisser place à l'évolution de la ville, le minaret a été préservé et transformé en horloge. Il est maintenant un repère central à Miliana, situé à proximité de la maison de l'Emir Abdelkader.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "deab31a0-dad3-4edc-8387-b3d53e30a27f", "translation" => "على الرغم من هدم المسجد الأصلي في عام 1856 لتفسير مجرى التطور الحضري للمدينة، تم الاحتفاظ بالمئذنة وتحويلها إلى برج ساعة. أصبحت الآن علامة مرجعية مركزية في مليانة، وتقع بالقرب من منزل الأمير عبد القادر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //582
            ["id" => "f1ca1918-9055-45bf-b55b-5adf468f46ad", "translation" => "Despite its deterioration, this ruined building is a silent witness to a bygone era, inviting visitors to reflect on the history of the region and imagine the life that once animated these places.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2a11afd9-a583-4a3b-892f-5bc06d9953a8", "translation" => "Malgré sa détérioration, cette bâtisse en ruine est un témoin silencieux d'un passé révolu, invitant les visiteurs à réfléchir sur l'histoire de la région et à imaginer la vie qui animait autrefois ces lieux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f3f493b0-ce4a-46a5-9ec9-a7f34eb29111", "translation" => "على الرغم من تدهورها، هذا البناء المدمر هو شاهد صامت على عصر مضى، مما يدعو الزوار إلى التفكير في تاريخ المنطقة وتصور الحياة التي كانت تملأ هذه الأماكن في السابق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //583
            ["id" => "1d19103f-5db4-400d-8a9d-fa2e19d3a368", "translation" => "The El Kawakeb cinema is an iconic venue in Khemis Miliana, offering the residents an unforgettable cinematic experience since many years. Located in the heart of the city, this cinema is a true cultural landmark for movie enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a10d2b22-5a5e-469a-b131-f534a447c097", "translation" => "Le cinéma el Kawakeb est un lieu emblématique de Khemis Miliana, offrant aux habitants une expérience cinématographique inoubliable depuis de nombreuses années. Situé au cœur de la ville, ce cinéma est un véritable repère culturel pour les amateurs de films.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c0d1925d-b00e-4886-ac33-173cdfb02651", "translation" => "سينما الكواكب هي مكان رمزي في خميس مليانة، تقدم للسكان تجربة سينمائية لا تُنسى منذ السنوات العديدة. يقع هذا السينما في قلب المدينة، وهو معلم ثقافي حقيقي لعشاق الأفلام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //584
            ["id" => "4e06d3d8-f6e7-425a-b971-b7c3f401ca09", "translation" => "This garden is a meeting place and a space for socializing, where residents gather to socialize, take walks, or simply relax. It serves as a true green lung in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "74a0a08a-7533-463a-ba38-9e1ce97a73f1", "translation" => "Ce jardin est un lieu de rencontre et de convivialité, où les habitants se retrouvent pour socialiser, se promener ou simplement se détendre. Il constitue un véritable poumon vert au cœur de la ville", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4e05991e-40c2-4e4a-b927-ee4f8a181ea5", "translation" => "هذا الحديقة مكان للالتقاء والتواصل، حيث يتجمع السكان للتفاعل الاجتماعي، التجول، أو مجرد الاسترخاء. إنها تعتبر رئة خضراء حقيقية في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //585
            ["id" => "309145a0-9cdc-4ee7-af2a-0d0b8213689d", "translation" => "Hammam Righa is a renowned thermal resort that combines tourism, wellness, and therapeutic treatments in an exceptional natural setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "176e3f42-dac1-4756-9efa-e2e5a0f22c72", "translation" => "Hammam Righa est une station thermale réputée qui allie tourisme, bien-être et traitements thérapeutiques dans un cadre naturel exceptionnel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3656c9b4-1d3e-46cf-8749-49f9c13cb544", "translation" => "حمّام ريغا هو منتجع حراري معروف يجمع بين السياحة والعافية والعلاجات في إطار طبيعي استثنائي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //586
            ["id" => "4111c188-4649-419a-b75c-c6df05563c17", "translation" => "The mosque of Sidi Ahmed ben Youcef is a monument of great importance in the Miliana region. It takes its name from a mystical figure buried in this town. This mosque is renowned not only for its architectural value but also for its significant social impact.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e47d6f64-f70d-4a32-96fd-f8dad0c8a746", "translation" => "La mosquée de Sidi Ahmed ben Youcef est un monument d'une grande importance dans la région de Miliana. Elle tire son nom d'une figure mystique enterrée dans cette ville. Cette mosquée est réputée non seulement pour sa valeur architecturale, mais aussi pour son impact social significatif.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b962b434-f472-4703-bb26-1f7ceb396a86", "translation" => "مسجد سيدي أحمد بن يوسف هو نصب ذو أهمية كبيرة في منطقة مليانة. إنه يأخذ اسمه من شخصية صوفية مقدسة دفنت في هذه المدينة. يشتهر هذا المسجد ليس فقط بقيمته المعمارية، ولكن أيضًا بتأثيره الاجتماعي الكبير.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //587
            ["id" => "4a74278e-0ceb-4e5b-836a-9cddd37d4687", "translation" => "The ramparts of Miliana have a rich history and have played an essential role in the protection of the city over the centuries. Initially built on the orders of Emperor Hadrian, they were reconstructed by the Turks to fortify the city and its Casbah. Subsequently, the French military engineering redesigned them during the creation of the new urban plan for the modern city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f6dcb96e-77f5-4022-b2fd-13d7463deec4", "translation" => "Les remparts de Miliana ont une histoire riche et ont joué un rôle essentiel dans la protection de la ville au fil des siècles. Initialement construits sur ordre de l'empereur Hadrien, ils ont été reconstruits par les Turcs pour renforcer la ville et sa Casbah. Par la suite, le génie militaire français les a réaménagés lors de la création du nouveau plan urbain de la ville moderne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ba79abd5-462a-4baf-b9da-8ceb242f8ab3", "translation" => "أسوار مليانة لديها تاريخ غني ولعبت دورًا أساسيًا في حماية المدينة على مر العصور. تم بناؤها أصلاً بأمر من الإمبراطور هادريان، وتم إعادة بناؤها من قبل الأتراك لتعزيز المدينة وقلعتها. بعد ذلك، قامت الهندسة الفرنسية بإعادة تصميمها خلال إعداد الخطة الحضرية الجديدة للمدينة الحديثة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //588
            ["id" => "18bf475d-674d-41f4-8a71-eaefee35dbb5", "translation" => "The archaeological site of el Amra presents a fascinating history dating back to probably the 1st century BC. Originally, it was a Roman fort and a center of Neo-Christian population. Subsequently, the site experienced a second occupation during the medieval era, in the 13th and 14th centuries, with the construction of a fortified Qal'a.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1258601d-6ea7-4b47-9b2d-1964e80e136e", "translation" => "Le site archéologique d'El Amra présente une histoire fascinante remontant probablement au 1er siècle avant Jésus-Christ. À l'origine, il était un fort romain et un centre de population néo-chrétien. Par la suite, le site a connu une deuxième occupation durant l'ère médiévale, aux XIIIe et XIVe siècles, avec l'érection d'une Qal'a fortifiée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "547f0e37-e152-4e75-b3d3-91558a4e1004", "translation" => "موقع العامرة الأثري يقدم تاريخًا مثيرًا يعود على الأرجح إلى القرن الأول قبل الميلاد. في الأصل، كان قلعة رومانية ومركزًا للسكان المسيحيين الجدد. في وقت لاحق، عاش الموقع احتلالًا ثانيًا خلال العصور الوسطى، في القرنين الثالث عشر والرابع عشر، مع إقامة قلعة محصنة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //589
            ["id" => "5fd60ef5-92bd-4d80-af5f-3fdcdc880526", "translation" => "This garden is a green and tranquil space amidst the urban hustle and bustle. Despite its modest size, it provides a place for relaxation and rejuvenation for residents and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1e37aeec-d4e5-4ce7-bd88-74bbad216e59", "translation" => "Ce jardin est un espace de verdure et de tranquillité au milieu de l'agitation urbaine. Malgré sa taille modeste, il offre un espace de détente et de ressourcement pour les habitants et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2e56acb4-5da1-459b-b6b1-422154a4724e", "translation" => "هذه الحديقة هي مساحة خضراء ومكان هادئ وسط صخب الحياة الحضرية. على الرغم من حجمها المتواضع، إلا أنها توفر مكانًا للراحة واستعادة النشاط للسكان والزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //590
            ["id" => "32f6acc6-0c67-4ca9-8c4e-f39f1349751a", "translation" => "Whether you're a nature photography enthusiast, an amateur ornithologist, or simply someone who appreciates the tranquil beauty of nature, the Ghrib dam is the ideal place for you to marvel at the diversity of wildlife and flora.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9628a12c-a20a-4f93-9797-6a3d03e2618b", "translation" => "Que vous soyez un passionné de photographie nature, un ornithologue amateur ou simplement quelqu'un qui apprécie la beauté tranquille de la nature, le barrage de Ghrib est l'endroit idéal pour vous émerveiller devant la diversité de la faune et de la flore.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "da0cf32a-d218-4d94-9d7d-85b96c5bd792", "translation" => "سواء كنت مهووسًا بتصوير الطبيعة، أو هاوي علم الطيور، أو مجرد شخص يقدر جمال الطبيعة الهادئة، فإن سد غريب هو المكان المثالي بالنسبة لك لتذهل أمام تنوع الحياة البرية والنباتات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //591
            ["id" => "47da47d1-e249-4d37-aa3b-6818bafa130c", "translation" => "The Cheikh Bouamama equestrian center is an enchanting place where everyone can find their happiness. Families seeking rest and relaxation find an ideal place to rejuvenate. Athlete runners come to train for their upcoming competitions. Riders, accompanied by their horses, enjoy the various jumps and rides offered by the center. Ponies, on the other hand, happily roam the area, bringing much joy to the children present.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dbb0338d-f9a1-4c13-a853-8a2422fb396f", "translation" => "Le centre équestre Cheikh Bouamama est un lieu enchanteur où chacun peut trouver son bonheur. Les familles en quête de repos et de détente y trouvent un endroit idéal pour se ressourcer. Les athlètes coureurs viennent s'y entraîner pour préparer leurs prochaines compétitions. Les cavaliers, accompagnés de leurs chevaux, profitent des sauts et des randonnées variées offertes par le centre. Les poneys, quant à eux, parcourent joyeusement les lieux, apportant beaucoup de joie aux enfants présents.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "06b488cf-2eab-4d0f-baf0-63dbd098e7df", "translation" => "مركز الفروسية الشيخ بوعمامة هو مكان ساحر حيث يمكن للجميع أن يجدوا سعادتهم. العائلات الباحثة عن الراحة والاسترخاء تجد هنا مكانًا مثاليًا للاستعادة. يأتي العدائين الرياضيون هنا للتدريب استعدادًا مسابقاتهم القادمة. يستمتع الفارسون، بصحبة خيولهم، بالقفزات والرحلات المتنوعة التي يقدمها المركز. أما الأفراس الصغار، فيتجولون بسعادة في المكان، مما يضفي الفرح الكبير على الأطفال الحاضرين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //592
            ["id" => "e7e1f757-d2a1-4374-a164-198c2c18060d", "translation" => "This small park with children's attractions is an ideal place for families in search of entertainment and moments of togetherness. It provides a safe and playful environment where children can have fun", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cd207784-6418-4c2c-9cc3-7bc279ef60b5", "translation" => "Ce petit parc avec des attractions pour enfants est un lieu idéal pour les familles en quête de divertissement et de moments de complicité. Il offre un environnement sécurisé et ludique où les enfants peuvent s'amuser.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3c596cb2-bab0-4ccf-91a2-5d8eb25840f7", "translation" => "هذه الحديقة الصغيرة مع مرافق للأطفال هي مكان مثالي للعائلات الباحثة عن الترفيه ولحظات القرب والتلاحم. إنها توفر بيئة آمنة وممتعة حيث يمكن للأطفال الاستمتاع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //593
            ["id" => "be26a78c-37a6-4ee8-b0be-8db1167d48a2", "translation" => "The Rostom amusement park is a place of adventure and entertainment that delights visitors of all ages. Located in an enchanting setting, this park offers a variety of exciting attractions that guarantee unforgettable moments of fun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cba25401-0a6a-457e-8e20-8f04d1aa618e", "translation" => "Le parc d'attractions Rostom Park est un lieu d'aventures et de divertissement qui fait le bonheur des visiteurs de tous âges. Situé dans un cadre enchanteur, ce parc offre une variété d'attractions excitantes qui garantissent des moments de plaisir inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "040d1b1f-3951-4e71-adb4-90ce1b650fac", "translation" => "حديقة رستم بارك للتسلية هو مكان مليء بالمغامرات والترفيه يسعد الزوار من جميع الأعمار. يقع في إطار ساحر، يقدم هذا المنتزه مجموعة متنوعة من الأماكن المثيرة التي تضمن لحظات ممتعة لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //594
            ["id" => "5253c0fa-f3e1-43a0-924a-5030ea75a032", "translation" => "When visiting the museum, visitors are invited to reflect on the past, honor the freedom fighters, and appreciate the cost of independence. It is a place filled with emotion and respect, bearing witness to the precious legacy of the mujahideen and their contribution to the history of Algeria.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ea886433-49e4-42be-a682-59236cc4f9bf", "translation" => "En visitant le musée, les visiteurs sont invités à réfléchir sur le passé, à honorer les combattants pour la liberté et à apprécier le prix de l'indépendance. C'est un lieu empreint d'émotion et de respect, témoignant de l'héritage précieux des moudjahidin et de leur contribution à l'histoire de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7e6ba4bc-7d91-4675-a7f1-ab915c572deb", "translation" => "عند زيارة المتحف، يُدعى الزوار إلى التفكير في الماضي، وتكريم أبطال الحرية، وتقدير ثمن الاستقلال. إنه مكان مليء بالعواطف والاحترام، يشهد على التراث الثمين للمجاهدين ومساهمتهم في تاريخ الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //595
            ["id" => "9d2abdd2-ae29-4db1-bd4e-600c2cc41302", "translation" => "This natural oasis is a true haven for those looking to recharge in the outdoors, explore the beauty of nature, and escape the hustle and bustle of urban life. The Mina waterfalls are a natural treasure that invites visitors to connect with the splendor of nature and enjoy a memorable getaway in an enchanting setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ec2304d5-8778-4439-ba76-1520a694deda", "translation" => "Cet oasis naturel est un véritable refuge pour ceux qui cherchent à se ressourcer en plein air, à explorer la beauté de la nature et à échapper à l'agitation de la vie urbaine. Les chutes de Mina sont un trésor naturel qui invite les visiteurs à se connecter avec la splendeur de la nature et à profiter d'une escapade mémorable dans un cadre enchanteur.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "75c15274-3b86-4b6b-aec1-9fe47f05e026", "translation" => "هذا الواحة الطبيعية هي ملاذ حقيقي لأولئك الذين يبحثون عن الاسترخاء في الهواء الطلق، واستكشاف جمال الطبيعة، والهروب من صخب الحياة الحضرية. شلالات مينا هي كنز طبيعي يدعو الزوار للاتصال بروعة الطبيعة والاستمتاع بإجازة لا تُنسى في إطار ساحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //596
            ["id" => "a69f7bf6-7515-4dee-9e50-d735a629ae5a", "translation" => "These mysterious pyramids were erected between the 5th and 6th centuries BC and serve as the tombs of Amazigh princes. They bear witness to the historical and cultural significance of the region, providing a fascinating glimpse into the civilization that built them.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a16c13cd-0a3b-4d6a-b17a-c21bc3ae4f46", "translation" => "Ces pyramides mystérieuses ont été érigées entre le Ve et le VIe siècle avant J.-C. et sont les tombes des princes amazighs. Elles témoignent de l'importance historique et culturelle de la région, offrant un aperçu fascinant de la civilisation qui les a érigées.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b21e2857-f268-4e79-9466-a1b512de41bc", "translation" => "هذه الأهرامات الغامضة أُقيمت بين القرنين الخامس والسادس قبل الميلاد وتُستخدم كقبور للأمراء الأمازيغ. إنها تشهد على أهمية هذه المنطقة من الناحية التاريخية والثقافية، مقدمة نظرة مثيرة إلى الحضارة التي قامت ببنائها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //597
            ["id" => "87e141a4-46bb-430f-b92b-d146ed0d52df", "translation" => "These mysterious pyramids were erected between the 5th and 6th centuries BC and serve as the tombs of Amazigh princes. They bear witness to the historical and cultural significance of the region, providing a fascinating glimpse into the civilization that built them.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bc0eff9b-955e-4553-941a-94395e753ede", "translation" => "Ces pyramides mystérieuses ont été érigées entre le Ve et le VIe siècle avant J.-C. et sont les tombes des princes amazighs. Elles témoignent de l'importance historique et culturelle de la région, offrant un aperçu fascinant de la civilisation qui les a érigées.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "177bc663-f69e-4824-a700-8e38594632da", "translation" => "هذه الأهرامات الغامضة أُقيمت بين القرنين الخامس والسادس قبل الميلاد وتُستخدم كقبور للأمراء الأمازيغ. إنها تشهد على أهمية هذه المنطقة من الناحية التاريخية والثقافية، مقدمة نظرة مثيرة إلى الحضارة التي قامت ببنائها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //598
            ["id" => "f701f8cf-3169-48f8-a10f-bc3d1816bb02", "translation" => "The cave of Ibn Khaldoun is located in the village of Taghazout. This place is both a Berber fortress that has been inhabited by various tribes since the 2nd century and a site of historical significance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "47c8f911-9073-43cf-826b-84a8c11a8db5", "translation" => "La grotte d'Ibn Khaldoun se trouve dans le village de Taghazout. Cet endroit est à la fois une forteresse berbère qui a été habitée par différentes tribus dès le 2ème siècle, ainsi qu'un lieu d'importance historique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cb9a4fac-59e6-40c2-8dd5-c52afb0db8f4", "translation" => "مغارة ابن خلدون تقع في قرية تاوغازوت. هذا المكان هو في الوقت نفسه حصن أمازيغي تمت استيطانه بواسطة مجموعات مختلفة منذ القرن الثاني، فضلاً عن أهميته التاريخية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //599
            ["id" => "6f5866ba-a87b-411a-9fb2-03cc1b66935a", "translation" => "The ruins of the Rustamid state provide a glimpse into the past and an opportunity to discover the cultural and historical heritage of the Tagdemt region. It is a site of great importance for those interested in history and archaeology.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d6ed509f-d4d5-4f85-8c65-486215b6d1e7", "translation" => "Les ruines de l'état Rustumide offrent ainsi une plongée dans le passé et une occasion de découvrir l'héritage culturel et historique de la région de Tagdemt. C'est un site d'une grande importance pour ceux qui s'intéressent à l'histoire et à l'archéologie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d8ea0456-fee5-43d0-bd57-eb181250cfd1", "translation" => "آثار الدولة الرستمية تقدم نافذة إلى الماضي وفرصة لاكتشاف التراث الثقافي والتاريخي لمنطقة تاقدمت. إنه موقع ذو أهمية كبيرة لأولئك الذين يهتمون بالتاريخ والآثار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //600
            ["id" => "64964951-8d5c-40bd-954f-1daeffd09aae", "translation" => "Whether you're a craft enthusiast, a collector, or simply curious to discover the cultural treasures of Tiaret, the chamber of crafts and trades is a must-visit place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8e823ab8-b23c-4c18-ac06-d30f95d80d43", "translation" => "Que vous soyez un amateur d'artisanat, un collectionneur ou simplement curieux de découvrir les richesses culturelles de Tiaret, la chambre de l'artisanat et des métiers est un lieu incontournable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4a93494f-9564-4c81-bbd4-d8c4d065a670", "translation" => "سواء كنت عاشقًا للحرف اليدوية، أو مجمّعًا، أو مجرد فضولي لاكتشاف الكنوز الثقافية في تيارت، فإن غرفة الصناعات والحرف اليدوية هي مكان لا غنى عنه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //601
            ["id" => "f202bbc3-4aa1-48ef-99e7-9c7d66ac89d6", "translation" => "The Ben Khedda dam is much more than a functional infrastructure; it has become a popular leisure and recreational area for families, and nature enthusiasts. Whether for sports activities, relaxation, or simply enjoying the natural beauty, it offers something for everyone.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cb5d430b-0f5d-46bf-9e7c-bdbb75a5e83a", "translation" => "Le barrage ben Khedda est donc bien plus qu'une infrastructure fonctionnelle, il est devenu un lieu de détente et de loisirs apprécié par les familles et les amoureux de la nature. Que ce soit pour pratiquer des activités sportives, se détendre ou simplement profiter de la beauté naturelle", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7bf1b17e-09cc-4ea4-8c05-35d8beec29f9", "translation" => "سد بن خدة ليس مجرد بنية تحتية وظيفية، بل أصبح مكانًا للاسترخاء والترفيه محبوبًا من قبل العائلات وعشاق الطبيعة. سواءً كان ذلك لممارسة الأنشطة الرياضية، أو الاسترخاء، أو مجرد الاستمتاع بجمال الطبيعة، فإنه يقدم شيئًا للجميع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //602
            ["id" => "2d042cdf-c0b6-47f2-8746-b1cbfec79ad7", "translation" => "The el Atik mosque is a historically significant religious monument of great value, both architecturally and spiritually. Its aesthetic beauty and cultural significance make it a sought-after destination for history enthusiasts, architecture aficionados, and travelers looking for an enriching religious tourism experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "05cb3461-5aab-4256-88e7-e74cc4499ea0", "translation" => "la mosquée el Atik est un monument historique religieux d'une grande valeur, tant sur le plan architectural que spirituel. Sa beauté esthétique et son importance culturelle en font une destination prisée pour les amateurs d'histoire, les passionnés d'architecture et les voyageurs à la recherche d'une expérience de tourisme religieux enrichissante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b41db7cb-acf8-4a27-9ed9-f037490b267e", "translation" => "مسجد العتيق هو معلم ديني تاريخي ذو قيمة كبيرة، سواء من الناحية المعمارية أو الروحية. جماله وأهميته الثقافية يجعلانه وجهة مشهورة لعشاق التاريخ وعشاق الهندسة المعمارية والمسافرين الباحثين عن تجربة سياحية دينية غنية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //603
            ["id" => "4720405e-53ad-4112-aeff-4553093b857b", "translation" => "The Chaouchaoua horse breeding center is an equestrian breeding center of great importance in the city of Tiaret. It embodies the region's pride as the capital of Maghreb and Arab horses and attracts horse enthusiasts from across the country. It is an iconic place where equine breeding is preserved and celebrated, contributing to the enrichment of Algeria's equestrian culture.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0559b156-3f29-4bf1-a208-2ddc2d6bc6d2", "translation" => "Le haras national de Chaouchaoua est un centre d'élevage équestre d'une grande importance dans la ville de Tiaret. Il incarne la fierté de la région en tant que capitale du cheval maghrébin et arabe, et attire les amateurs de chevaux venus de tout le pays. C'est un lieu emblématique où l'élevage équin est préservé et célébré, contribuant ainsi à l'enrichissement de la culture équestre de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "203f2b44-b097-41d8-aafa-4ea0c979b4b1", "translation" => "مركز تربية الخيول شاوشاوة هو مركز لتربية الخيول ذو أهمية كبيرة في مدينة تيارت. يمثل فخر المنطقة كعاصمة للخيول المغربية والعربية، ويجذب عشاق الخيول من جميع أنحاء البلاد. إنه مكان رمزي حيث يتم الاحتفاظ والاحتفال بتربية الخيول، مما يسهم في إثراء ثقافة رياضة الفروسية في الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //604
            ["id" => "7437e90e-7095-4241-9e5a-99f3af3e013e", "translation" => "Whether it's for a relaxing stroll or family games, the park provides a space for relaxation and leisure for the local residents.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e2e5d733-495f-422e-a166-edaa1cc8bd69", "translation" => "Que ce soit pour une promenade relaxante, des jeux en famille. Le parc offre un espace de détente et de loisirs pour les habitants de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d6e82654-67d5-4ffb-8091-a65a11dccc9c", "translation" => "سواء كنت تبحث عن نزهة مريحة أو ألعاب عائلية، تقدم الحديقة مكانًا للاسترخاء والترفيه لسكان المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //605
            ["id" => "e1072d09-2c35-4485-a6ed-25c0164e2c6c", "translation" => "Whether it's for a quiet solo stroll, a pleasant conversation with friends, or a welcome break, the Sidi Abderrahmane garden provides a naturally captivating setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8d763615-9505-4658-9961-4029e1335b24", "translation" => "Que ce soit pour une simple balade solitaire, une conversation agréable entre amis ou une pause bienvenue, le jardin de Sidi Abderrahmane offre un cadre naturellement captivant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "81193aed-8ebf-4122-b2ad-7ca0347cfb9b", "translation" => "سواء كنت تبحث عن جولة هادئة منفردة، أو محادثة ممتعة بين الأصدقاء، أو استراحة مرحبة، حديقة سيدي عبد الرحمن توفر إطارًا جذابًا بشكل طبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //606
            ["id" => "6c1637a3-9f2e-4feb-8ade-3440456c04b1", "translation" => "The Sidi Houari forest is teeming with fascinating biodiversity. Wildlife and plant enthusiasts will be delighted by the diversity of plant and animal species that inhabit this ecosystem.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e9b9f5e1-abeb-4642-889e-6851573340c5", "translation" => "La forêt de Sidi Houari regorge d'une biodiversité fascinante. Les amateurs de faune et de flore seront enchantés par la diversité des espèces végétales et animales qui peuplent cet écosystème.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "be747d59-7136-4092-8761-e23e8782ce6e", "translation" => "غابة سيدي هواري مليئة بالتنوع البيولوجي الرائع. سيكون عشاق الحياة البرية والنباتات مسرورين بالأنواع النباتية والحيوانية التي تعيش في هذا النظام البيئي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //607
            ["id" => "5732a4b8-ac1b-424b-981c-89e5ff04cb45", "translation" => "The Family amusement park offers a fun and entertaining experience for the whole family. It's the perfect place to create unforgettable memories and share moments of happiness together.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "42fd515b-9aca-43ef-bd7e-b242688bc322", "translation" => "Le parc d’attractions Family Park offre une expérience amusante et divertissante pour toute la famille. C'est l'endroit idéal pour créer des souvenirs inoubliables et partager des moments de bonheur ensemble.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "39bd82d5-d746-4e9f-bbd4-06cfd6e207cd", "translation" => "حديقة فاميلي بارك تقدم تجربة ممتعة ومسلية لكامل العائلة. إنه المكان المثالي لخلق ذكريات لا تُنسى ومشاركة لحظات سعيدة معًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //608
            ["id" => "32c6c6c3-340f-4443-ba40-e44b29e93039", "translation" => "The mudjahid museum of Tissemsilt is an essential place of memory that recalls the courage and determination of the fighters of the war of independence. It is a place where one can delve into the past to better understand and appreciate the journey towards freedom.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1e0070f7-50e5-4368-8364-5d838aee89b3", "translation" => "Le musée du Moudjahid de Tissemsilt est un lieu de mémoire essentiel qui rappelle le courage et la détermination des combattants de la guerre d'indépendance. C'est un endroit où l'on peut se plonger dans le passé pour mieux comprendre et apprécier le chemin parcouru vers la liberté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "62cbbba3-3ca8-4d00-a81b-24ea2a5a4980", "translation" => "متحف المجاهد في تيسمسيلت هو مكان ذو أهمية كبيرة للذاكرة يُذكِّر بشجاعة وعزيمة مجاهدين حرب الاستقلال. إنه مكان يمكن للزائرين أن يتغمسوا في الماضي لفهم وتقدير الرحلة نحو الحرية بشكل أفضل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //609
            ["id" => "c768f686-c3fd-43c5-9e0e-6c6a5dc440e0", "translation" => "Although theatrical performances are not frequent, the open-air theater in Tissemsilt remains an important cultural symbol for the city. It stands as a testament to artistic and creative potential that can be developed and nurtured.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b6ab81a4-654f-440b-8c89-3b0243d20998", "translation" => "Bien que les représentations théâtrales ne soient pas fréquentes, le théâtre en plein air de Tissemsilt reste un symbole culturel important pour la ville. Il est le témoin d'un potentiel artistique et créatif qui peut être développé et nourri.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7deaa540-08a0-4fe5-b680-09c2bf2a28b5", "translation" => "وعلى الرغم من أن العروض المسرحية ليست متكررة، إلا أن مسرح تيسمسيلت المفتوح يظل رمزا ثقافيا هاما للمدينة. وهو شاهد على إمكانات فنية وإبداعية يمكن تطويرها ورعايتها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //610
            ["id" => "d9609614-564c-4923-8c5c-9215bc77798a", "translation" => "The Bougara dam is an impressive body of water that offers numerous opportunities for recreation and relaxation. With its vast surface area, it is a true paradise for fishing enthusiasts, and those seeking moments of relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d1cdea32-2f3d-4d47-ad14-cc49a63754a6", "translation" => "Le barrage de Bougara est un impressionnant plan d'eau qui offre de nombreuses opportunités de loisirs et de détente. Avec sa superficie étendue, il constitue un véritable paradis pour les amateurs de pêche, et de moments de relaxation.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "81859c28-376f-4ac5-bfed-5003f95ebaa6", "translation" => "سد بوقارة هو جسم مائي رائع يقدم العديد من الفرص للترفيه والاسترخاء. بفضل مساحته الواسعة، فهو جنة حقيقية لهواة الصيد وأولئك الذين يبحثون عن لحظات من الاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //611
            ["id" => "5860061d-6f78-409a-afe9-e69c219ed091", "translation" => "The Theniet El Had national park is a true natural gem that provides visitors with the opportunity to connect with nature, explore breathtaking landscapes, and discover remarkable biodiversity. Whether it's for hiking, wildlife observation, or simply to recharge, this national park promises an unforgettable experience for all nature lovers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fd522f60-9d43-450e-8514-683ff3e52fc3", "translation" => "Le parc national de Theniet El Had est un véritable joyau naturel qui offre aux visiteurs la possibilité de se connecter avec la nature, d'explorer des paysages époustouflants et de découvrir une biodiversité remarquable. Que ce soit pour la randonnée, l'observation des animaux ou simplement se ressourcer, ce parc national promet une expérience inoubliable pour tous les amoureux de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f4ecff67-5c01-46ac-8fce-f251696d4f9a", "translation" => "الحظيرة الوطنية ثنية الأحد جوهرة طبيعية حقيقية تقدم للزوار فرصة للاتصال مع الطبيعة واستكشاف مناظر خلابة واكتشاف تنوعاً ملحوظاً في البيئة الحيوية. سواء كنت تشمل الرحلات الجبلية أو مراقبة الحياة البرية أو ببساطة للتجديد، يعد هذا المتنزه الوطني تجربة لا تُنسى لجميع عشاق الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //612
            ["id" => "b73e9c6a-dd55-4494-a1d5-984650fcc50d", "translation" => "The Ain Antar regional park is a privileged place for nature lovers, hikers, and ecotourism enthusiasts who will discover the natural wonders of the park while enjoying breathtaking panoramic views.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f5decdd5-0705-40ff-aed3-907e037a17fb", "translation" => "Le parc régional de Ain Antar est un lieu privilégié pour les amoureux de la nature, les randonneurs et les amateurs d'écotourisme. qui découvriront les merveilles naturelles du parc tout en profitant de vues panoramiques à couper le souffle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "128928e6-7b72-4ccf-a2eb-9b36052d578f", "translation" => "منتزه عين عنتر هو مكان مميز لعشاق الطبيعة وراغبي المشي وعشاق السياحة البيئية، حيث سيكتشفون عجائب الطبيعة في الحديقة و يستمتعون بمناظر بانورامية رائعة تأسر الألباب.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //613
            ["id" => "38fe8478-0d04-490d-8826-5233078cf0c4", "translation" => "The statue of the Emir Abdelkader embodies the admiration and respect for this iconic leader in Algerian history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1c15b940-ee35-40f7-b825-71973547b80b", "translation" => "La statue de l'Emir Abdelkader incarne l'admiration et le respect envers ce leader emblématique de l'histoire algérienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1b7b6084-1a61-40b9-a89a-c780d34b9dcd", "translation" => "تمثال الأمير عبد القادر يجسد الإعجاب والاحترام نحو هذا الزعيم البارز في تاريخ الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //614
            ["id" => "97d3a04a-13eb-489e-911e-ba4b9fcba8cb", "translation" => "The municipal museum of Bordj el Emir Abdelkader is a must-visit for history enthusiasts, the curious, and anyone looking to discover and appreciate the rich cultural heritage of the region. It provides an enriching experience that stimulates the mind and arouses curiosity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1e5d9697-d1b6-46e9-b913-18f827f8babf", "translation" => "Le musée communal de Bordj el Emir Abdelkader est un lieu incontournable pour les passionnés d'histoire, les curieux et tous ceux qui souhaitent découvrir et apprécier le riche héritage culturel de la région. Il offre une expérience enrichissante qui nourrit l'esprit et suscite la curiosité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3069baa6-2ab4-4b66-885e-c18ebce72596", "translation" => "المتحف البلدي لبرج الأمير عبد القادر هو مكان لا بد من زيارته لهواة التاريخ والفضوليين ولأي شخص يتطلع إلى اكتشاف وتقدير التراث الثقافي الغني للمنطقة. إنه يوفر تجربة غنية تحفز العقل وتثير الفضول.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //615
            ["id" => "96ca8bfb-936a-49a7-860b-b16a13030849", "translation" => "The citadel of Emir Abdelkader is a place steeped in history and symbolism, offering visitors the opportunity to explore the cultural heritage and legacy of the region. Its visit allows one to delve into the past and appreciate the resistance and struggle led by Emir Abdelkader and his people.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "680ed5c0-16f6-419b-a6c5-6c17021d440e", "translation" => "La citadelle de l'Emir Abdelkader est un lieu chargé d'histoire et de symbolisme, offrant aux visiteurs l'opportunité de découvrir le patrimoine culturel et l'héritage de la région. Sa visite permet de se plonger dans le passé et d'apprécier la résistance et la lutte menées par l'Emir et son peuple.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bdfa8274-b580-4e52-8791-6febccb3d650", "translation" => "قلعة الأمير عبد القادر مكان محمل بالتاريخ والرمزية، حيث توفر للزوار الفرصة لاستكشاف التراث الثقافي والإرث للمنطقة. زيارتها تمكّن الزائرين من الانغماس في الماضي وتقدير المقاومة والكفاح التي قادها الأمير عبد القادر وشعبه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //616
            ["id" => "e74eedf1-f82d-4ccb-85f2-16d3d5914e38", "translation" => "Thanks to their mineral-rich waters, the thermal resorts of Sidi Slimane have become a preferred destination for medical tourism, offering specialized facilities and equipment for this activity. However, they also attract visitors seeking recreational tourism due to their pleasant natural environment and the relaxing benefits of the thermal waters.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ed5815c4-149d-4749-9edb-96cceb00f1ae", "translation" => "Grâce à leurs eaux riches en minéraux, les stations thermales de Sidi Slimane sont devenues un lieu privilégié pour le tourisme médical, offrant des structures et des équipements spécialement dédiés à cette activité. Cependant, elles attirent également les visiteurs en quête de tourisme récréatif, grâce à leur environnement naturel agréable et aux bienfaits relaxants des eaux thermales.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e6b25abd-e519-41cc-838f-1422cd9fe992", "translation" => "بفضل مياهها الغنية بالمعادن، أصبحت منتجعات العلاج بالمياه الحرارية في سيدي سليمان وجهة مفضلة للسياحة الطبية، حيث تقدم مرافق وتجهيزات متخصصة لهذا النشاط. ومع ذلك، فهي تجذب أيضًا الزوار الباحثين عن السياحة الترفيهية بفضل بيئتها الطبيعية الجميلة وفوائد مياه العلاج الحرارية المريحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //617
            ["id" => "ae4e8c53-f011-41d5-ac59-7e6cf8139d17", "translation" => "The Beni Chaib dam is more than just a hydraulic structure. It plays a crucial role in the economic development of the region while providing a natural environment of great beauty and remarkable biological diversity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a3c653f9-5f4b-46ea-8d93-1233cdc2a0a6", "translation" => "Le barrage de Beni Chaib est bien plus qu'une simple infrastructure hydraulique. Il joue un rôle essentiel dans le développement économique de la région, tout en offrant un environnement naturel d'une grande beauté et une diversité biologique remarquable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9032947e-19e6-42b8-8ef1-9029fbe56ce9", "translation" => "سد بني شعيب هو أكثر من مجرد هيكل هيدروليكي. إنه يلعب دورًا حاسمًا في التنمية الاقتصادية للمنطقة مع توفير بيئة طبيعية جميلة بشكل كبير وتنوعًا بيولوجيًا ملحوظًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //618
            ["id" => "f7db4aac-7f91-4c30-81b1-b476aeec7940", "translation" => "The Bin el Kifane site is a historic location situated in the Ouarsenis mountains. It contains the ruins of Camp Claude Lozes Church and a building that once housed orphaned children and victims of World War II.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0a8faf2d-5926-4b5d-8392-91333f852d6f", "translation" => "Le site de Bin el Kifane est un lieu historique situé dans les montagnes des Ouarsenis. On y trouve les ruines de l'église Camp Claude Lozes et un bâtiment qui accueillait des enfants orphelins et des victimes de la Seconde Guerre mondiale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a72dae35-3003-4ccd-9979-c2e3d5ab62be", "translation" => "موقع بين الكيفان هو مكان تاريخي يقع في جبال الونشريس. يحتوي على أطلال كنيسة كامب كلود لوزيس ومبنى كان يستضيف في السابق الأطفال الأيتام وضحايا الحرب العالمية الثانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //619
            ["id" => "8935b491-5c36-46a8-a47f-0f59dce094da", "translation" => "The green garden is a beautiful park located in the city center. This garden provides a green and peaceful setting where visitors can relax and enjoy nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2735354e-9a1c-4c05-82e3-34f9733338f5", "translation" => "Le jardin de la verdure est un magnifique parc situé en centre ville. Ce jardin offre un cadre verdoyant et paisible où les visiteurs peuvent se détendre et profiter de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b581ac12-91a8-47a9-a469-4d16adcd5687", "translation" => "حديقة الحروف هي حديقة جميلة تقع في وسط المدينة. توفر هذه الحديقة بيئة خضراء وساحرة حيث يمكن للزوار الاسترخاء والاستمتاع بالطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //620
            ["id" => "55f0f7dc-b496-4133-a703-26cfc84fc2c8", "translation" => "This museum houses a collection of artifacts, photographs, and documents related to the period of the struggle for Algeria's independence. Visitors can explore exhibitions that highlight the courage and sacrifice of the freedom fighters, as well as the history and key events of that period.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "48b29f14-5c92-4d0c-af8e-9c25480395ce", "translation" => "Ce musée abrite une collection d'artefacts, de photographies et de documents relatifs à la période de la lutte pour l'indépendance de l'Algérie. Les visiteurs peuvent y découvrir des expositions qui mettent en valeur le courage et le sacrifice des moudjahidin, les combattants de la liberté, ainsi que l'histoire et les événements clés de cette période.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ed7633f4-51a1-4878-a8fc-3fa179503574", "translation" => "يضم هذا المتحف مجموعة من القطع الأثرية والصور والوثائق المتعلقة بفترة النضال من أجل استقلال الجزائر. يمكن للزوار استكشاف المعارض التي تسلط الضوء على شجاعة وتضحية مجاهدي الحرية، بالإضافة إلى تاريخ وأحداث هذه الفترة الزمنية الهامة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //621
            ["id" => "dc489eb6-0f6d-43db-8644-0013aa00b65d", "translation" => "The Batna cinematheque is an important cultural venue dedicated to cinema. It is a space that aims to promote and preserve the local cinematic heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3db3ef77-34d1-470b-8e27-9c7ba4e66678", "translation" => "La cinémathèque de Batna est un lieu culturel important dédié au cinéma. C'est un espace qui vise à promouvoir et à préserver le patrimoine cinématographique local.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "007553ab-9134-45f1-a75d-e25c70ef8a59", "translation" => "سينماتيك باتنة هي مكان ثقافي هام مخصص للسينما. إنها مساحة تهدف إلى تعزيز والمحافظة على التراث السينمائي المحلي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //622
            ["id" => "91cf7c97-0a3b-4042-959a-e49e368c746d", "translation" => "The May 1, 1945 square is a lively and dynamic space located in the heart of the city. Surrounded by historical and modern buildings, this square is a meeting and gathering point for residents and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3f0342e9-1820-45bf-bc58-7d44a6d3434e", "translation" => "La place du 1er Mai 1945 est un espace animé et dynamique situé au cœur de la ville. Entourée de bâtiments historiques et modernes, cette place est un point de rencontre et de rassemblement pour les habitants et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "48a1b023-25e0-4375-a77e-be10bd4dd92f", "translation" => "ساحة 1 ماي 1945 هي مكان حيوي وديناميكي يقع في قلب المدينة. محاطة بالمباني التاريخية والحديثة، تعتبر هذه الساحة نقطة للاجتماع والتجمع للسكان والزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //623
            ["id" => "fde95685-effc-4360-9350-fbbf1285c843", "translation" => "The house of culture in Batna is a place dedicated to the promotion and dissemination of culture in the city. It is a building that houses a variety of artistic and cultural activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5a64a11f-0797-4d79-b829-a8a09fe20c53", "translation" => "La maison de la culture de Batna est un lieu dédié à la promotion et à la diffusion de la culture dans la ville. C'est un bâtiment qui abrite une variété d'activités artistiques et culturelles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "70858f22-ff0f-4981-b878-587af1f48fdb", "translation" => "دار الثقافة في باتنة مكان مخصص للترويج ونشر الثقافة في المدينة. إنه مبنى يحتضن مجموعة متنوعة من الأنشطة الفنية والثقافية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //624
            ["id" => "063bf98a-e5a1-4c8f-a4ca-2e42a2427fed", "translation" => "The monument to the Martyrs of Batna and its large square are symbols of collective memory and commitment to freedom. They contribute to the cultural identity of the city and are important places of commemoration and gathering for the local population and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ebad2f67-01c1-4a51-99ed-f85a368fe5ba", "translation" => "Le monument aux martyrs de Batna et sa grande place sont des symboles de la mémoire collective et de l'engagement pour la liberté. Ils contribuent à l'identité culturelle de la ville et sont des lieux de commémoration et de rassemblement importants pour la population locale et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d3404f7e-f484-468a-b9fe-bd084fb23eae", "translation" => "مقام الشهيد باتنة وساحته الكبيرة هما رمزان للذاكرة الجماعية والتفاني من أجل الحرية. إنهما يسهمان في الهوية الثقافية للمدينة وهما أماكن مهمة للاحتفال والتجمع للسكان المحليين والزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //625
            ["id" => "fa0dd753-6455-44c1-817a-60b149ab7e6d", "translation" => "The Ghoufi balconies are a true natural treasure, offering spectacular and captivating landscapes. They attract many visitors in search of archaeological discoveries, natural beauty, and a unique tourist experience in the Aures region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fa50f559-04ce-45d2-b187-be5f54f9861d", "translation" => "Les balcons de Ghoufi sont un véritable trésor naturel, offrant des paysages spectaculaires et captivants. Ils attirent de nombreux visiteurs en quête de découvertes archéologiques, de beauté naturelle et d'une expérience touristique unique dans la région des Aurès.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4dbb21ef-2f3d-49ea-8479-02334a6647aa", "translation" => "شرفات غوفي هي كنز طبيعي حقيقي، حيث تقدم مناظر خلابة ومذهلة. إنها تجذب العديد من الزوار الباحثين عن اكتشافات أثرية وجمال طبيعي وتجربة سياحية فريدة في منطقة الأوراس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //626
            ["id" => "6f7c6e04-82cb-4c18-b614-4be5ed0fa0a6", "translation" => "The Transatlantic Hotel remains a notable tourist destination. Its fascinating history and architecture reflect a bygone era. Although restoration has not been undertaken, the place still draws the attention of visitors who want to uncover its rich past and learn more about its significance during the colonial period.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "53bb1f53-ea10-4062-886d-7997d1fdbaf3", "translation" => "l'Hôtel Transatlantique demeure une destination touristique notable. Son histoire fascinante et son architecture témoignent d'une époque révolue. Bien que la restauration n'ait pas été réalisée, le lieu attire encore l'attention des visiteurs qui souhaitent découvrir son passé riche et en apprendre davantage sur son importance pendant la période coloniale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b6e8cb7b-d58f-401a-a058-6790c4ab3329", "translation" => "فندق ترانس أتلانتيك لا يزال وجهة سياحية بارزة. تاريخه الرائع وهندسته يعكسان حقبة مضت. على الرغم من أنه لم يتم إجراء أعمال ترميم، إلا أن هذا المكان ما زال يجذب انتباه الزوار الذين يرغبون في استكشاف ماضيها الغني والتعرف على أهميته خلال الفترة الاستعمارية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //627
            ["id" => "d1563b0a-3fc6-4823-ac7c-73719c126b61", "translation" => "Whether you're seeking adventure, relaxation, or a nature discovery, the Koudiet Lamdaouar dam is the perfect place to escape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8b3cf865-562b-4b7b-a1e3-34b332a70bc1", "translation" => "Que vous soyez en quête d'aventure, de détente ou de découverte de la nature, le barrage de Koudiet Lamdaouar est l'endroit idéal pour s'évader.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4b8528a2-51bb-4f12-beda-c6be335a7622", "translation" => "سواء كنت تبحث عن المغامرة أو الاسترخاء أو اكتشاف الطبيعة، سد كدية لمدور هو المكان المثالي للاستمتاع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //628
            ["id" => "44994828-9853-442a-96e0-4084c20114e6", "translation" => "The archaeological site of Timgad is a true treasure that will immerse you in the history of ancient Rome. Its exceptional state of preservation and unique urban planning make it a must-visit destination for history enthusiasts and archaeology aficionados.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "90b7c5d5-3c55-4ab5-ac40-d5d62692d2bc", "translation" => "Le site archéologique de Timgad est un véritable trésor qui vous plongera dans l'histoire de la Rome antique. Son état de conservation exceptionnel et sa planification urbaine unique en font une destination incontournable pour les amateurs d'histoire et les passionnés d'archéologie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "52ec72bd-5c89-4a5d-9b5d-149b8308e989", "translation" => "موقع تيمقاد الأثري هو كنز حقيقي سيأخذك في رحلة عبر تاريخ روما القديم. حالته الاستثنائية للحفاظ وتخطيطه الحضري الفريد يجعلانه وجهة لا بد من زيارتها لعشاق التاريخ وعشاق علم الآثار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //629
            ["id" => "99eaccf4-495b-4e38-9086-831ad38a8703", "translation" => "The Imedghassen mausoleum site is a significant tourist destination, although there are around ten other Berber mausoleums buried within a radius of about 500 meters. Unfortunately, over time, these mausoleums have collapsed and are in ruins.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "74038d3f-a7e3-4754-865a-a96b5c701c31", "translation" => "Le site du mausolée Imedghassen est un lieu touristique d'importance, bien qu’il existe une dizaine d'autres mausolées berbères enfouis dans une circonférence d'environ 500 mètres. Malheureusement, au fil du temps, ces mausolées se sont effondrés et sont en ruines.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "33feeaba-d8ff-4541-8727-ca79361a4ef7", "translation" => "موقع ضريح إيمدغاسن هو وجهة سياحية مهمة، على الرغم من وجود حوالي عشرة ضربان بربرية أخرى مدفونة في نصف قطر يبلغ حوالي 500 مترًا. للأسف، عبر الزمن، تهدمت هذه الأضرحة وأصبحت في حالة خراب.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //630
            ["id" => "8c0fee36-d951-4f73-9a6e-7606b4a25680", "translation" => "The Timgad museum houses a rich collection of artifacts and archaeological discoveries that testify to the greatness of the Roman city. It also provides historical information and explanatory panels to guide you in your exploration of the archaeological site. This way, you can fully appreciate the remains of the city and immerse yourself in its history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "11ff168d-f940-4657-8c00-7ac32dccd166", "translation" => "Le musée de Timgad abrite une riche collection d'artefacts et de découvertes archéologiques qui témoignent de la grandeur de la cité romaine. Il offre également des informations historiques et des panneaux explicatifs pour vous guider dans votre exploration du site archéologique. Vous pourrez ainsi apprécier pleinement les vestiges de la cité et vous immerger dans son histoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "62e14f56-8fcf-49de-a38c-4a7d5fa13fdb", "translation" => "متحف تيمقاد يضم مجموعة غنية من الآثار والاكتشافات الأثرية التي تشهد على عظمة المدينة الرومانية. كما يقدم معلومات تاريخية ولوحات توضيحية لتوجيهك في استكشاف الموقع الأثري. بهذه الطريقة، يمكنك أن تقدر تمامًا بقايا المدينة وتتغمد نفسك في تاريخها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //631
            ["id" => "9b6da60c-57a2-44ff-8cba-1c706b907c7c", "translation" => "The archaeological site of Lambaesis was once considered the military capital of Roman Africa. Today, it is a top tourist destination due to its strategic location, historical significance, and preservation of its ruins.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "336928eb-b54e-40cb-b7f5-99cdf190f86b", "translation" => "Le site archéologique de Lambaesis était autrefois considéré comme la capitale militaire de l'Afrique romaine. Aujourd'hui, il est une destination touristique de premier choix en raison de sa position stratégique, de son importance historique et de la préservation de ses vestiges.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "650e3116-5aa3-44dd-812e-33206d557a00", "translation" => "موقع لامبايزيس الأثري كان يُعتبر في السابق عاصمةً عسكريةً لأفريقيا الرومانية. اليوم، يعتبر وجهة سياحية رئيسية بسبب موقعها الاستراتيجي، وأهميتها التاريخية، والحفاظ على آثارها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //632
            ["id" => "73c891d0-9771-4174-aa70-5ffdf07a93e4", "translation" => "Whether for history enthusiasts, researchers, or simply the curious, the Tazoult museum offers an enriching and educational experience, complementing the visit to the Lambaesis archaeological site for a complete immersion in the Roman history of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "38ebc6b9-c70f-418e-b343-38382794dd45", "translation" => "Que ce soit pour les amateurs d'histoire, les chercheurs ou simplement les curieux, le musée de Tazoult offre une expérience enrichissante et éducative, complétant ainsi la visite du site archéologique de Lambaesis pour une immersion complète dans l'histoire romaine de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5d35244c-8323-44d1-95ce-4cbbee110264", "translation" => "سواء كنت من عشاق التاريخ أو الباحثين أو مجرد الفضوليين، يقدم متحف تازولت تجربة غنية وتعليمية، مكملةً بذلك زيارة الموقع الأثري لامبايزيس للانغماس الكامل في تاريخ الرومان في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //633
            ["id" => "6718a18e-1dc4-483a-be80-4dc62a7ec1c5", "translation" => "The church square is a central and historic space in the heart of the city. At the center of this square stands a church that, although no longer used as a place of worship, has been transformed into an office for the Red Crescent.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b13c0c4b-2154-49ae-9f1f-0758b2574a4a", "translation" => "La place de l'église est un espace central et historique au cœur de la ville. Au centre de cette place se trouve une église qui, bien que ne servant plus de lieu de culte, a été transformée en bureau pour le Croissant Rouge.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "11f4a7b5-2913-4d7f-97ae-06a045e1e85a", "translation" => "ساحة الكنيسة هي مساحة مركزية وتاريخية في قلب المدينة. في وسط هذه الساحة يقف كنيسة، وعلى الرغم من أنها لم تعد تستخدم كمكان للعبادة، إلا أنها تم تحويلها إلى مكتب للهلال الأحمر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //634
            ["id" => "285b340d-1468-4cb5-b4b8-002102c5aadd", "translation" => "This archaeological site is a historical gem that deserves to be further explored and studied by history and archaeology enthusiasts. It provides a unique opportunity to delve into the Roman history of the region and understand its significance in the broader context of the Roman Empire.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "014230bc-94c9-4463-9a60-e215aca4ac36", "translation" => "Ce site archéologique est un joyau historique qui mérite d'être davantage exploré et étudié par les passionnés d'histoire et d'archéologie. Il offre une occasion unique de plonger dans l'histoire romaine de la région et de comprendre son importance dans le contexte plus large de l'Empire romain.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "613d2e6c-2e98-43a2-aaa3-7f73333c4541", "translation" => "هذا الموقع الأثري هو جوهرة تاريخية تستحق أن تكون مستكشفة ومدروسة بشكل أعمق من قبل عشاق التاريخ وعلماء الآثار. إنه يقدم فرصة فريدة للغوص في تاريخ الرومان في المنطقة وفهم أهميتها في السياق الأوسع للإمبراطورية الرومانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //635
            ["id" => "00056a60-b86d-4d51-8c8f-c4d9c4fc4606", "translation" => "The Belezma national park is an exceptional site that deserves in-depth exploration and an expansion of tourist routes to allow visitors to discover its natural beauty and unique biodiversity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d10a0f17-f2b2-4508-a6e7-89d7c11f8491", "translation" => "Le parc national de Belezma est un site exceptionnel qui mérite une exploration approfondie et une intensification des circuits touristiques pour permettre aux visiteurs de découvrir sa beauté naturelle et sa biodiversité unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d113bcb8-0e94-4a03-91cd-e9771e0c8c04", "translation" => "الحظيرة الوطنية بلزمة هو موقع استثنائي يستحق استكشافًا متعمقًا وتوسيع دوائر السياحة للسماح للزوار باكتشاف جماله الطبيعي والتنوع البيئي الفريد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //636
            ["id" => "df4cb304-92cf-4c62-879a-71221a66edd0", "translation" => "The Lompi family park is a perfect place to spend a delightful day with your family, enjoy the attractions, have fun in the water, and create unforgettable memories. Whether it's for a relaxing day out or to celebrate special occasions, this amusement park offers an entertaining and enjoyable experience for all visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8d96cdf9-dfe4-4e17-a0d9-4cfba41b07da", "translation" => "Le Lompi Family Park est un endroit idéal pour passer une journée agréable en famille, profiter des attractions, s'amuser dans l'eau et créer des souvenirs inoubliables. Que ce soit pour une journée de détente ou pour célébrer des occasions spéciales, ce parc d'attractions offre une expérience divertissante et divertissante pour tous les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "85246471-398f-4261-bc12-dc95d72234bf", "translation" => "حديقة لومبي فاميلي بارك هي مكان مثالي لقضاء يوم ممتع مع العائلة، والاستمتاع بالألعاب والمرح في الماء، وخلق ذكريات لا تُنسى. سواء كان ذلك لقضاء يوم استراحة أو للاحتفال بالمناسبات الخاصة، تقدم هذه الحديقة الترفيهية تجربة مسلية وممتعة لجميع الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //637
            ["id" => "252bc313-d485-4808-80cd-33af9ce0dc8e", "translation" => "The Djerma equestrian center in Batna is a place dedicated to horse riding enthusiasts and horse lovers. It provides modern facilities and quality services for horse sports enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a6b01488-d445-43cb-9a39-7fd43f096c09", "translation" => "Le Centre d'équitation de Djerma à Batna est un lieu dédié aux amateurs d'équitation et aux passionnés de chevaux. Il offre des installations modernes et des services de qualité pour les amateurs de sports équestres.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4a8a1b4f-46af-4056-99b7-f136aa9468c4", "translation" => "مركز جرمة للفروسية في باتنة هو مكان مخصص لهواة ركوب الخيل وعشاق الخيول. يوفر مرافق حديثة وخدمات عالية الجودة لهواة الرياضات الفروسية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //638
            ["id" => "2d0b2967-e1ff-4f54-99dc-34b8efd9ba5c", "translation" => "The Tasrift gorges are an ideal place for nature lovers and hiking enthusiasts. The hiking trails that run through the gorges allow you to discover beautiful landscapes, spectacular rock formations, and lush vegetation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e16c7e1f-ead9-4ec0-b68f-4d5c5d9ad5c3", "translation" => "Les gorges de Tasrift sont un endroit idéal pour les amoureux de la nature et les amateurs de randonnée. Les sentiers de randonnée qui traversent les gorges permettent de découvrir des paysages magnifiques, des formations rocheuses spectaculaires et une végétation luxuriante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e828f3de-fd82-47be-924c-2e100dd64f05", "translation" => "مضائق تاسريفت هي مكان مثالي لعشاق الطبيعة وهواة المشي لمسافات طويلة. يتيح لك مسارات المشي التي تمر عبر المضائق اكتشاف مناظر طبيعية جميلة وتكوينات صخرية رائعة ونباتات خصبة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //639
            ["id" => "6fe89b5f-1b97-4654-a676-f6a697163b55", "translation" => "The Iguelfen and Baloul attic are architectural remnants of significant historical value, situated along the banks of the Ighzer Amellal. These communal granaries were constructed by the Amazigh residents several centuries ago, bearing witness to their skill and deep connection to their land.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1ab8c0c8-e78f-4de8-97a5-d11ddfcac7a1", "translation" => "Les greniers de Iguelfen et de Baloul sont des vestiges architecturaux d'une grande valeur historique, situés le long des rives de l'Ighzer Amellal. Ces greniers collectifs ont été construits par les habitants amazighs il y a plusieurs siècles, témoignant de leur habileté et de leur attachement à leur territoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "db1f6637-a3c6-40e1-b702-96567904cba5", "translation" => "قلعة ايڤلفن وبالول هي بقايا معمارية لها قيمة تاريخية كبيرة، موجودة على طول ضفاف نهر إغزر أملاّل. تم بناء هذه المخازن الجماعية من قبل سكان الأمازيغ قبل قرون عدة، مشهدين لمهارتهم وارتباطهم العميق بأرضهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //640
            ["id" => "e2fa0792-1e90-46e4-a2fc-429e11b8bd5e", "translation" => "The Iguelfen and Baloul attic are architectural remnants of significant historical value, situated along the banks of the Ighzer Amellal. These communal granaries were constructed by the Amazigh residents several centuries ago, bearing witness to their skill and deep connection to their land.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "42749234-bf59-48e8-aaf1-cf4bb6be0b31", "translation" => "Les greniers de Iguelfen et de Baloul sont des vestiges architecturaux d'une grande valeur historique, situés le long des rives de l'Ighzer Amellal. Ces greniers collectifs ont été construits par les habitants amazighs il y a plusieurs siècles, témoignant de leur habileté et de leur attachement à leur territoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3921c422-3d4c-4e40-bd62-57e7f7b8d7c1", "translation" => "قلعة ايڤلفن وبالول هي بقايا معمارية لها قيمة تاريخية كبيرة، موجودة على طول ضفاف نهر إغزر أملاّل. تم بناء هذه المخازن الجماعية من قبل سكان الأمازيغ قبل قرون عدة، مشهدين لمهارتهم وارتباطهم العميق بأرضهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //641
            ["id" => "ac827f7d-f0c9-44f3-b11f-efcfea096925", "translation" => "The fort of el Kenzeria is an ancient military citadel dating back to Roman times. Built by the Romans, it was later used by the Ottomans to quell popular uprisings. Under the French colonial regime, it continued to serve a similar strategic role.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6d502879-af7e-48da-afec-8ef03dcdeeb0", "translation" => "Le fort el Kenzeria est une ancienne citadelle militaire qui remonte à l'époque romaine. Construit par les Romains, il a ensuite été utilisé par les Ottomans pour faire face aux soulèvements populaires. Sous le régime colonial français, il a continué à jouer un rôle stratégique similaire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "681bd985-9463-4225-8d79-343f57ad7e83", "translation" => "قلعة الكنزرية هي حصن عسكري قديم يعود إلى عصر الرومان. تم بناؤه من قبل الرومان، واستُخدم في وقت لاحق من قبل العثمانيين لاخماد التمردات الشعبية. وتحت النظام الاستعماري الفرنسي، استمرت في أداء دور استراتيجي مماثل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //642
            ["id" => "9b321287-ee00-42ca-913c-d50642deb1af", "translation" => "The November 1st mosque is an imposing and majestic place of worship, offering a spacious and beautifully decorated prayer space. Its unique architecture, combining Moorish and local influences, makes it a symbol of Chaoui culture and an architectural gem of the Batna region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c9dce777-341c-4f3b-a423-9649be4a6fff", "translation" => "La mosquée du 1er novembre est un lieu de culte imposant et majestueux, offrant un espace de prière spacieux et magnifiquement décoré. Son architecture unique, combinant des influences mauresques et locales, en fait un symbole de la culture chaouie et un joyau architectural de la région de Batna.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "120447da-d682-4b15-a72d-b9e223a04344", "translation" => "مسجد 1 نوفمبر هو مكان عبادة فخم، يوفر مساحة صلاة واسعة ومزينة بشكل جميل. تصميمه المعماري الفريد الذي يجمع بين التأثيرات المغاربية والمحلية يجعله رمزًا لثقافة الشاوية وجوهرة معمارية في منطقة باتنة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //643
            ["id" => "0b0710f8-ad77-4f6a-b958-376e6d3d2291", "translation" => "Whether for a leisurely stroll or simply to rejuvenate, this garden provides a pleasant setting for all who visit it.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d68d3188-6f41-4771-afb3-c41277850ef0", "translation" => "Que ce soit pour une promenade tranquille ou simplement pour se ressourcer, ce jardin offre un cadre agréable pour tous ceux qui le visitent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9fbc4849-340c-4aca-9f59-0ceebda0fd11", "translation" => "سواءً كنت تتجول برفقة أو تبحث ببساطة عن استراحة، توفر هذا الحديقة بيئة ممتعة لجميع من يزورها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //644
            ["id" => "918f0d4e-00f0-4bf8-9d55-feea1308a06b", "translation" => "The aquatic complex provides a relaxing and refreshing experience with a spacious and well-maintained swimming pool and a spa with a dedicated space for relaxation and rejuvenation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f176d8ce-912a-4b72-ae8a-e1e94b7529b4", "translation" => "Le complexe aquatique offre une expérience de détente et de rafraîchissement avec une piscine spacieuse et bien entretenue ainsi qu’un spa avec un espace dédié à la relaxation et à la détente.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f16e0714-0ee4-4cf0-b0ee-ff06a36b9151", "translation" => "المجمع المائي توفر تجربة استرخاء وتجدد مع مسبح واسع ومحافظ عليه بشكل جيد ومنتجع صحي مع مساحة مخصصة للاسترخاء واستعادة النشاط.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //645
            ["id" => "cc9fd599-d789-45e6-a56e-5aeddb2edaee", "translation" => "Despite the years that have passed since their construction, the remains of the Legate's baths continue to impress with their architecture and historical significance. They are a fascinating reminder of the ancient history of the region and deserve to be explored by archaeology enthusiasts and those curious about Roman civilization.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d4e41f40-a5c0-49a2-94c4-1c0604e80ec9", "translation" => "Malgré les années écoulées depuis leur construction, les vestiges des thermes du légat continuent d'impressionner par leur architecture et leur importance historique. Ils sont un rappel fascinant de l'histoire ancienne de la région et méritent d'être explorés par les amateurs d'archéologie et les curieux intéressés par la civilisation romaine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5ea058ce-b967-4620-91e1-d57c8daeb25d", "translation" => "بالرغم من السنوات التي مرت منذ بنائها، ما زالت آثار حمامات الليڨا تثير الإعجاب بمعمارها وأهميتها التاريخية. إنها تذكير مثير بتاريخ المنطقة القديم وتستحق أن تتم استكشافها من قبل عشاق الآثار والفضوليين المهتمين بالحضارة الرومانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //646
            ["id" => "a279897d-0f1e-40b2-896a-bbf758bd5700", "translation" => "The Ksar Bellezma site houses the remains of an ancient Byzantine fort. This fort was initially used as an observation post by the Byzantines, and it continued to serve this strategic role after the fall of the Byzantine Empire when Muslim dynasties took control of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "98b12770-9814-4ca3-a9da-691476a6cd52", "translation" => "Le site de Ksar Bellezma abrite les vestiges d'un ancien fort byzantin. Ce fort était initialement utilisé comme poste d'observation par les Byzantins, et il a continué à jouer ce rôle stratégique après la chute de l'Empire byzantin, lorsque les dynasties musulmanes ont pris le contrôle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f804a82e-917f-4f78-b02d-9db4b8bcc7fe", "translation" => "موقع قصر بلازمة يضم آثار قلعة بيزنطية قديمة. استُخدمت هذه القلعة في البداية كمرصد من قبل البيزنطيين، واستمرت في أداء هذا الدور الاستراتيجي بعد سقوط الإمبراطورية البيزنطية عندما استولت الأسر الإسلامية على المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //647
            ["id" => "5dfc0e82-c7e7-4dd9-a0b5-0c9002d0e596", "translation" => "The regional theater of Batna is an iconic venue in the city's artistic and cultural scene that contributes to the city's cultural life by providing quality entertainment and fostering an appreciation for the arts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b39c649b-15e1-45bc-9a38-3eaef91f1ba7", "translation" => "Le théâtre régional de Batna est un lieu emblématique de la scène artistique et culturelle de la ville qui contribue à la vie culturelle de la ville en offrant des divertissements de qualité et en encourageant l'appréciation des arts.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "51391c2b-15e4-4eb0-aeb3-4b64efbf6cf6", "translation" => "مسرح ولاية باتنة هو مكان بارز في الساحة الفنية والثقافية للمدينة يسهم في الحياة الثقافية للمدينة من خلال تقديم ترفيه عالي الجودة وتعزيز تقدير الفنون.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //648
            ["id" => "948d672f-7128-429f-a760-d4ddc8c99b84", "translation" => "Whether it's a family outing, an educational visit, or simply to appreciate the beauty of nature, the Oum el Bouaghi zoological park is a must-visit place. It provides an enriching experience where visitors can admire the diversity of wildlife while fostering an awareness of nature conservation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d00ec9f2-140e-4a26-9078-1f3c66294358", "translation" => "Que ce soit pour une sortie en famille, une visite éducative ou simplement pour apprécier la beauté de la nature, le parc zoologique d'Oum el Bouaghi est un endroit incontournable. Il offre une expérience enrichissante, où les visiteurs peuvent admirer la diversité de la faune tout en développant une conscience de la préservation de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "863fc01f-efee-4ac0-90ee-3cbdda09b775", "translation" => "سواء كنت تبحث عن رحلة عائلية أو زيارة تعليمية أو مجرد التمتع بجمال الطبيعة، حديقة الحيوانات في أم البواقي هي مكان لا بد من زيارته. إنها تقدم تجربة غنية، حيث يمكن للزوار أن يعجبوا بتنوع الحياة البرية مع تعزيز الوعي بحفظ الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //649
            ["id" => "c2780f75-ffda-4143-b027-cf817b1e4a28", "translation" => "The museum of the mujahid in Oum El Bouaghi plays an important role in preserving the collective memory and transmitting patriotic values to current and future generations. It serves as a place of commemoration and remembrance, inviting visitors to reflect on the past and appreciate the cost of freedom.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "29c6f069-68ea-47de-a48f-f582cbb3605f", "translation" => "Le musée du moudjahid d'Oum El Bouaghi joue un rôle important dans la préservation de la mémoire collective et dans la transmission des valeurs patriotiques aux générations actuelles et futures. Il constitue un lieu de commémoration et de souvenir, invitant les visiteurs à réfléchir sur le passé et à apprécier le prix de la liberté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "94750876-c22a-48ea-8f0e-8bf2b3b23cd8", "translation" => "متحف المجاهد في أم البواقي يلعب دورًا مهمًا في الحفاظ على الذاكرة الجماعية ونقل القيم الوطنية إلى الأجيال الحالية والمستقبلية. إنه مكان للاحتفال والتذكير، حيث يدعو الزوار إلى التأمل في الماضي وتقدير تكلفة الحرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //650
            ["id" => "178c770d-3e1b-4f04-b318-5dff8f3773e8", "translation" => "This garden provides a green space amidst the urban hustle and bustle, allowing visitors to enjoy a place of relaxation and tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "60f320c0-a905-459f-b69b-be21a491ddef", "translation" => "Ce jardin offre un espace verdoyant au milieu de l'agitation urbaine, permettant aux visiteurs de profiter d’un lieu de détente et de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4896e01e-21c5-4939-aace-8ddaf3d02aaf", "translation" => "هذه الحديقة توفر مساحة خضراء في وسط صخب المدينة، مما يتيح للزوار الاستمتاع بمكان للاسترخاء والهدوء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //651
            ["id" => "8973fe93-b1c7-4c7b-9feb-46e0c8695e52", "translation" => "The regional theater of Ain Beida plays a crucial role in promoting culture and the arts in the region. It provides a space for creativity and artistic expression, thus fostering the development of the local artistic scene.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "08a91807-ef29-4103-bc7e-d33fa3bbf611", "translation" => "Le théâtre régional d'Ain Beida joue un rôle essentiel dans la promotion de la culture et des arts dans la région. Il offre un espace de créativité et d'expression artistique, favorisant ainsi l'épanouissement de la scène artistique locale", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1d1de9c4-47fa-439d-a7a4-7888750b8d2c", "translation" => "المسرح الجهوي في عين البيضاء يلعب دورًا حاسمًا في تعزيز الثقافة والفنون في المنطقة. إنه يوفر مساحة للإبداع والتعبير الفني، مما يعزز تطوير الساحة الفنية المحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //652
            ["id" => "573c6cf9-e7b1-425a-b3a3-3a7c517b8d66", "translation" => "The November 1st 1954 garden is a precious space that combines natural beauty, enjoyable activities for visitors, and historical heritage through the Roman artifacts it houses.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bfe045b9-c54e-4786-bcf7-b6a715b2f337", "translation" => "Le jardin du 1er Novembre 1954 est un espace précieux qui allie beauté naturelle, activités agréables pour les visiteurs et héritage historique grâce aux artefacts romains qu’il abrite.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "32c78341-2e7b-41e9-b483-47beda3057fa", "translation" => "حديقة 1 نوفمبر 1954 هي مكان قيم يجمع بين الجمال الطبيعي والأنشطة الممتعة للزوار والتراث التاريخي من خلال الآثار الرومانية التي تحتضنها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //653
            ["id" => "64b59c06-a3b0-4667-983e-73ba366b4f10", "translation" => "The archaeological site of Gadiaufala provides a fascinating glimpse into the history of this region, highlighting the cultural and economic influences that have shaped the lives of the local populations over the centuries. It represents a valuable testament to the significance of agriculture and trade in the region during that time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "09f21e6f-cfd6-4b68-840a-1a8b52943b08", "translation" => "Le site archéologique de Gadiaufala offre donc un aperçu fascinant de l'histoire de cette région, mettant en évidence les influences culturelles et économiques qui ont façonné la vie des populations locales à travers les siècles. Il représente un témoignage précieux de l'importance de l'agriculture et du commerce dans la région à cette époque.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "97ce87a1-e430-486d-b730-cc461089f700", "translation" => "موقع ڨاديوفالا الأثري يقدم نظرة شيقة إلى تاريخ هذه المنطقة، مسلطاً الضوء على التأثيرات الثقافية والاقتصادية التي شكلت حياة السكان المحليين على مر القرون. إنه يمثل شهادة قيمة على أهمية الزراعة والتجارة في المنطقة خلال تلك الفترة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //654
            ["id" => "862062d3-aa8b-4231-b463-d0a719a41c3a", "translation" => "The Dream Land amusement park is a perfect place to spend quality time with your family, have fun, and create unforgettable memories. Its location in the beautiful Bouzabine forest adds a natural and pleasant ambiance to the overall park experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "934b40fd-3c17-415c-badc-66487a00bd15", "translation" => "Le parc d'attractions Dream Land est un endroit idéal pour passer du temps en famille, se divertir et créer des souvenirs inoubliables. Son emplacement dans la magnifique forêt de Bouzabine ajoute une ambiance naturelle et agréable à l'expérience globale du parc.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d94349a9-038e-4c23-82b6-64530e36d9b1", "translation" => "حديقة دريم لاند هي مكان مثالي لقضاء وقت ممتع مع العائلة، والاستمتاع، وخلق ذكريات لا تُنسى. موقعها في غابة بوزابين الجميلة يضيف أجواء طبيعية وممتعة إلى تجربة المدينة بشكل عام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //655
            ["id" => "fc41a6c7-cb52-4d99-8251-a50de0ed5567", "translation" => "The Ezzemoul lake is a saltwater lake renowned as the largest breeding area for Mediterranean flamingos, attracting numerous ornithologists and bird enthusiasts. The presence of these elegant pink birds adds a touch of beauty and grace to the surrounding landscape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "014bec87-e798-4af4-8cff-d3511a3f52a2", "translation" => "Le lac Ezzemoul est un lac salé qui est réputé pour être la plus grande zone de nidification de flamants de la Méditerranée, attirant ainsi de nombreux ornithologues et amateurs d'oiseaux. La présence de ces élégants oiseaux roses ajoute une touche de beauté et de grâce au paysage environnant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c52fa409-8663-48d1-b259-7a7142ed64c1", "translation" => "بحيرة الزمول هي بحيرة مالحة مشهورة بأنها أكبر منطقة تكاثر نحام البحر الأبيض المتوسط، ما يجذب العديد من علماء علم الطيور وعشاق الطيور. ووجود هذه الطيور الوردية الأنيقة يضيف لمسة من الجمال والأناقة إلى المناظر الطبيعية المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //656
            ["id" => "66a16a7f-e307-40e4-a859-8f7602e0dc1d", "translation" => "The Tansilt lake is renowned for being a favorite spot for various migratory bird species such as storks, various types of ducks, and majestic flamingos. Visitors thus have the opportunity to admire these magnificent birds in their natural environment, creating a memorable experience for wildlife enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8eb32022-7ebc-447e-ac46-576cd5922152", "translation" => "Le lac Tansilt est réputé pour être un lieu de prédilection pour de nombreuses espèces d'oiseaux migrateurs tels que les cigognes, les canards de différentes variétés et les majestueux flamants roses. Les visiteurs ont ainsi l'opportunité d'admirer ces magnifiques oiseaux dans leur environnement naturel, créant une expérience mémorable pour les amoureux de la faune.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "31988ab3-695d-4bfe-87f4-9ddbd47f91a1", "translation" => "بحيرة تانسيلت مشهورة بأنها مكان مفضل للعديد من أنواع الطيور المهاجرة مثل اللقالق وأنواع مختلفة من البط والنحام الرائع. بالتالي، لدى الزوار الفرصة لمشاهدة هذه الطيور الرائعة في بيئتها الطبيعية، مما يخلق تجربة لا تُنسى لعشاق الحياة البرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //657
            ["id" => "8a4be2d7-c0a4-4c6c-a812-b6a4c9b730b1", "translation" => "The Timerganine lake is a true natural gem that attracts nature lovers, ornithologists, and ecotourism enthusiasts. Its classification as a protected reserve confirms its importance as a fragile ecosystem and contributes to its preservation for future generations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f587b4c6-dee7-471f-9b65-5cedbbb22a1b", "translation" => "Le lac Timerganine est un véritable joyau naturel qui attire les amoureux de la nature, les ornithologues et les passionnés d'écotourisme. Sa classification en tant que réserve protégée confirme son importance en tant qu'écosystème fragile et contribue à sa préservation pour les générations futures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "53efa944-3832-41fd-aa5d-dc373ddeb8e8", "translation" => "بحيرة تيمرقانين هي جوهرة طبيعية حقيقية تجذب عشاق الطبيعة وعلماء الطيور وعشاق السياحة البيئية. تصنيفها كمحمية يؤكد أهميتها كنظام بيئي هش ويسهم في الحفاظ عليها للأجيال القادمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //658
            ["id" => "0995ee9e-9a5b-4ca9-b548-356abfd2e8de", "translation" => "The Ourkis dam is a multifunctional site that combines tourist attractions, camping areas, and fishing opportunities. It serves as a popular place for relaxation and recreation for both local residents and visitors seeking moments of tranquility in the heart of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aba3a27c-de33-4eed-89c8-8f862c239891", "translation" => "Le barrage d'Ourkis est un site multifonctionnel qui combine à la fois des aspects touristiques, des espaces pour le camping et des possibilités de pêche. Il constitue un lieu de détente et de loisirs prisé par les habitants de la région ainsi que par les visiteurs en quête de moments de tranquillité au cœur de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e5443003-1354-42a0-9ee5-4061e7623193", "translation" => "سد أوركيس هو موقع متعدد الاستخدام يجمع بين جوانب سياحية، ومساحات للتخييم، وفرص للصيد. إنه مكان شهير للاسترخاء والترفيه على حد سواء للسكان المحليين والزوار الباحثين عن لحظات هدوء في قلب الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //659
            ["id" => "277a8bec-16d7-41ed-b8f8-860eb8414c57", "translation" => "The Guellif lake provides a remarkable natural landscape with its fluctuating water levels, salted shores, and characteristic vegetation. It serves as a vital habitat for numerous bird species and contributes to the region's biodiversity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2592712e-fff5-44ce-a4f1-85f06b3c5a87", "translation" => "Le lac Guellif offre un paysage naturel remarquable, avec ses niveaux d'eau variables, ses berges salées et sa végétation caractéristique. Il constitue un habitat vital pour de nombreuses espèces d'oiseaux et contribue à la biodiversité de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "92597897-63ce-4f94-9969-40ae2ce601f3", "translation" => "بحيرة ڨليف تقدم مناظر طبيعية استثنائية، بفضل مستويات مياهها المتغيرة، وشواطئها المالحة، ونباتاتها المميزة. إنها تعتبر موطنًا حيويًا للعديد من أنواع الطيور وتسهم في تعدد الأنواع في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //660
            ["id" => "1f953f1d-cd5f-4a43-b79e-48faef05f6e3", "translation" => "The house of culture in Oum el Bouaghi is a dynamic cultural venue that contributes to the artistic and cultural life of the region by hosting a variety of events and activities aimed at promoting the arts and fostering the cultural development of the community.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e98bcfe0-313e-4dc7-b71a-b4e072e6fec7", "translation" => "La maison de la culture d'Oum el Bouaghi est un lieu culturel dynamique qui contribue à la vie artistique et culturelle de la région en proposant une variété d'événements et d'activités destinés à promouvoir les arts et à favoriser l'épanouissement culturel de la communauté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7099569d-5395-40cc-b010-1c16d18e0181", "translation" => "دار الثقافة في أم البواقي هي مكان ثقافي دينامي يسهم في الحياة الفنية والثقافية للمنطقة من خلال استضافة مجموعة متنوعة من الأنشطة التي تهدف إلى تعزيز الفنون وتعزيز التنمية الثقافية للمجتمع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //661
            ["id" => "db4390e6-838b-4653-8923-c00acfe58649", "translation" => "This square is a place of life and conviviality, where residents come together, relax, and participate in urban life. It embodies the soul of the city and contributes to creating a sense of belonging and vibrancy within the community.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fa0f9cc5-937e-4876-aa22-d0072d3727a8", "translation" => "Cette place est un lieu de vie et de convivialité, où les habitants se retrouvent, se détendent et participent à la vie urbaine. Elle incarne l'âme de la ville et contribue à créer un sentiment d'appartenance et de dynamisme au sein de la communauté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8245d596-f888-4557-ab95-6a50b9f5abdb", "translation" => "هذه الساحة مكان للحياة والمرح، حيث يجتمع السكان و يسترخون ويشاركون في الحياة الحضرية. إنه يجسد روح المدينة ويساهم في خلق شعور بالانتماء والحيوية داخل المجتمع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //662
            ["id" => "c46c6ff5-2c73-4b0c-b5b4-47d4fdbb7695", "translation" => "The Ain Mlila craft house is an iconic place that celebrates local craftsmanship, thereby preserving the traditions and cultural heritage of the region. It is a must-visit destination for craft enthusiasts, curious tourists, and anyone looking to discover the creativity and talent of the local artisans.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2b75a0e9-536f-4f12-8fae-ba3efa6aeeef", "translation" => "La maison de l'artisanat d'Ain Mlila est un lieu emblématique qui célèbre l'artisanat local, préservant ainsi les traditions et le patrimoine culturel de la région. C'est un endroit incontournable pour les amateurs d'artisanat, les touristes curieux et tous ceux qui souhaitent découvrir la créativité et le talent des artisans de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0843255a-d61d-41c2-8d28-d62384c04bc4", "translation" => "دار الصناعة التقليدية الفنيّة في عين مليلة هو مكان رمزي يحتفي بالحرف اليدوية المحلية، مما يسهم في الحفاظ على التقاليد والتراث الثقافي للمنطقة. إنه وجهة يجب زيارتها لعشاق الحرف اليدوية والسياح المتطلعين ولأي شخص يرغب في اكتشاف إبداع ومهارة الحرفيين المحليين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //663
            ["id" => "93e39c8d-a0ce-4362-a8e7-ac65f66b0f7b", "translation" => "Ouled Gacem zoological park provides visitors with a memorable experience, allowing them to get up close to a variety of wild animals. It's an ideal place to relax, have fun, and learn more about wildlife.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "89f14bdc-b3ec-49c0-8150-a2c5b73839b9", "translation" => "Le parc zoologique d'Ouled Gacem offre aux visiteurs une expérience mémorable en leur permettant de côtoyer de près une variété d'animaux sauvages. C'est un lieu idéal pour se détendre, se divertir et en apprendre davantage sur la faune.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "00333141-f878-4015-b12b-92c27e6f1ef2", "translation" => "حديقة الحيوانات أولاد قاسم تقدم للزوار تجربة لا تُنسى حيث تسمح لهم بالاقتراب من مجموعة متنوعة من الحيوانات البرية. إنها مكان مثالي للاسترخاء والتسلية والتعرف على المزيد عن الحياة البرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //664
            ["id" => "55acd8a8-6764-4811-b6c0-c7f185253c6a", "translation" => "The Dreams World amusement park is a fantastic place where children can have fun, laugh, and experience thrilling adventures. With a variety of rides, games, and shows, this park offers an entertaining experience for the whole family.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e7d2f4aa-059c-46b0-aeee-8d31707548a2", "translation" => "Le parc d'attractions Dreams World est un endroit fantastique où les enfants peuvent s'amuser, rire et vivre des aventures palpitantes. Avec une variété de manèges, de jeux et de spectacles, ce parc offre une expérience divertissante pour toute la famille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e6b01c5a-1404-4e0a-b8b6-187ddc2ab709", "translation" => "حديقة دريمز وارلد للترفيه هي مكان رائع حيث يمكن للأطفال التسلية والضحك والاستمتاع بمغامرات مثيرة. مع مجموعة متنوعة من الألعاب والمراوح والعروض، يقدم هذا المنتزه تجربة ممتعة لجميع أفراد العائلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //665
            ["id" => "208b9c1d-9a12-478d-8e8f-9cfd981d2daa", "translation" => "The Khenchela museum is a cultural venue that provides a fascinating glimpse into the history and cultural richness of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b44349af-41af-4351-9f0d-01f2f9498eea", "translation" => "Le musée de Khenchela est un lieu culturel qui offre un aperçu fascinant de l'histoire et de la richesse culturelle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8d670d30-db14-42a2-8276-0a1674c4bd14", "translation" => "متحف خنشلة هو مكان ثقافي يقدم لمحة ساحرة عن تاريخ وثراء الثقافة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //666
            ["id" => "5f47df57-54ef-4b0f-9f81-645f63d499b9", "translation" => "The Abbas Laghrour square of Khenchela is a lively and dynamic space in the heart of the city. With its cafes, shops, resting areas, and cultural activities, it serves as a meeting point and gathering place for residents and visitors, contributing to the social and cultural identity of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fadd8775-9e72-4e3e-9d3e-0eb60206e321", "translation" => "L'esplanade Abbas Laghrour de Khenchela est un espace animé et dynamique au cœur de la ville. Avec ses cafés, ses commerces, ses espaces de repos et ses activités culturelles, elle représente un point de rencontre et de rassemblement pour les habitants et les visiteurs, contribuant ainsi à l'identité sociale et culturelle de de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6e3c08f1-59ef-430b-9b77-f1e681641a1d", "translation" => "ساحة عباس لغرور في خنشلة هي مكان نشط ودينامي في قلب المدينة. بفضل مقاهيها ومحلاتها ومناطق الاستراحة والأنشطة الثقافية، تعتبر نقطة التلاقي ومكان التجمع للسكان والزوار، مما يسهم في الهوية الاجتماعية والثقافية للمدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //667
            ["id" => "750441d5-5224-46c2-a507-552cf38a55cd", "translation" => "The Babar dam is a major infrastructure in the Khenchela region. By enabling irrigation for agricultural lands, providing drinking water, and transforming arid landscapes into green areas, it has had a significant impact on the quality of life for the region's residents.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7c439775-ddc5-48ed-ad8f-5e1809ca595a", "translation" => "Le barrage de Babar est un ouvrage majeur de la région de Khenchela. En permettant l'irrigation des terres agricoles, l'approvisionnement en eau potable et la transformation de paysages arides en zones verdoyantes, il a eu un impact significatif sur la qualité de vie des habitants de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3318b10e-1faf-417d-8e4b-215ee4039f0b", "translation" => "سد بابار هو بنية هامة في منطقة خنشلة. من خلال تمكين الري للأراضي الزراعية وتوفير المياه الشرب وتحويل المناظر الجافة إلى مناطق خضراء، كان له تأثير كبير على جودة حياة سكان المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //668
            ["id" => "8af9df33-f34a-481b-9d02-f5c37fc058ae", "translation" => "The Igli waterfalls is a natural treasure of the Khenchela region. With its majestic waterfalls, natural pool, and breathtaking landscapes, it provides a true haven of beauty and freshness where visitors can relax and rejuvenate in harmony with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fdfc6409-e531-41d8-a7ad-93cf2f969b38", "translation" => "Les chutes d'Igli sont un trésor naturel de la région de Khenchela. Avec leurs cascades majestueuses, leur piscine naturelle et leurs paysages à couper le souffle, elles offrent un véritable écrin de beauté et de fraîcheur où les visiteurs peuvent se détendre et se ressourcer en harmonie avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f3ffd283-603c-4baf-97b0-f3e7a72839c7", "translation" => "شلالات إڨلي هي كنز طبيعي في منطقة خنشلة. مع شلالاتها الرائعة وبركتها الطبيعية ومناظرها الخلابة، توفر مأوى حقيقيًا للجمال والانتعاش حيث يمكن للزوار الاسترخاء واستعادة نشاطهم في انسجام مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //669
            ["id" => "1256daee-01aa-4c66-8e52-1ca08e1a182d", "translation" => "This place is an ancient Roman bath, built during the Flavian dynasty period that ruled the Roman Empire at that time. The Hammam Essalihine offers a unique experience that combines history, well-being, and relaxation. With its warm thermal waters with beneficial properties and its comprehensive infrastructure, it provides visitors with the opportunity to rejuvenate and enjoy moments of relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "728c7320-1790-4714-93a2-6d13d32afd5d", "translation" => "Ce lieu est un ancien therme romain, construit pendant la période de la dynastie Flavienne qui gouvernait l'empire romain à cette époque. Hammam Essalihine offre donc une expérience unique qui allie histoire, bien-être et détente. Avec ses eaux thermales chaudes aux propriétés bénéfiques et son infrastructure complète, elle offre aux visiteurs l'occasion de se ressourcer et de profiter de moments de relaxation.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f3d56557-9fb8-4208-af24-f346b84be18c", "translation" => "هذا المكان هو حمام روماني قديم، تم بناؤه خلال فترة حكم الأسرة الفلافية التي حكمت الإمبراطورية الرومانية في تلك الفترة. يقدم حمّام الصالحين تجربة فريدة تجمع بين التاريخ والرفاهية والاسترخاء. بفضل مياهه الحرارية الدافئة ذات الخصائص المفيدة وبنيته التحتية الشاملة، يقدم هذا المكان للزوار فرصة للتجديد والاستمتاع بلحظات الاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //670
            ["id" => "2ad20dfb-a99c-47d8-ad19-afd47f128805", "translation" => "The archaeological site of Ksar Kahina, or the Palace of the Berber priestess, is a place steeped in history and symbolism. It allows visitors to explore the legacy and influence of the Berber queen Dihya while offering an immersive experience in the history of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1bd9b6c6-f5ea-4ebf-9408-caa13c7a235c", "translation" => "Le site archéologique de Ksar Kahina, ou le Palais de la prêtresse berbère, est un lieu chargé d'histoire et de symbolisme. Il permet aux visiteurs de découvrir l'héritage et l'influence de la reine berbère Dihya, tout en offrant une expérience immersive dans l'histoire de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8ed795af-b93c-40f3-bb15-0fcd5237c0fa", "translation" => "الموقع الأثري لقصر كاهينة، أو قصر الكاهنة الأمازيغية، هو مكان محمل بالتاريخ والرمزية. يسمح للزوار باستكشاف تراث وتأثير الملكة الأمازيغية ديهيا، مع تقديم تجربة غامرة في تاريخ المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //671
            ["id" => "fda8c01a-d6de-4364-9de1-9a5ef443ad09", "translation" => "Hammam el Knif is a hammam located in the mountains at an altitude of 1,120 meters and is known for its hot water temperature of 50 degrees Celsius. In addition to its therapeutic benefits, Hammam El Knif also offers a beautiful natural setting where visitors can enjoy the soothing and relaxing atmosphere of the hammam while admiring the surrounding landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5167c176-d682-4ec4-b7a9-4c273e8d7fb6", "translation" => "Le Hammam El Knif est un hammam situé dans les montagnes à une altitude de 1 120 mètres et est réputé pour sa température d'eau chaude de 50 degrés Celsius. En plus de ses vertus thérapeutiques, le Hammam El Knif offre également un cadre naturel magnifique où les visiteurs peuvent profiter de l'atmosphère apaisante et relaxante du hammam tout en admirant les paysages environnants.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b65dd005-ae85-463e-84a0-7eca94924221", "translation" => "حمام لكنيف هو حمّام يقع في الجبال على ارتفاع 1120 مترًا ومعروف بحرارة مياهه الساخنة التي تصل إلى 50 درجة مئوية. بالإضافة إلى فوائده العلاجية، يقدم حمام لكنيف أيضًا إعدادًا طبيعيًا جميلًا حيث يمكن للزوار الاستمتاع بالأجواء المهدئة والمريحة للحمام بينما يتمتعون بمشاهدة المناظر الطبيعية المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //672
            ["id" => "2414f34a-a08e-4c45-816e-47e8270b7cc6", "translation" => "Sebkhet Ouled Amara is a saline wetland area and a site of unique natural beauty, with saline soils and flora adapted to these conditions. It also hosts a rich avifauna, especially migratory birds.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ad1e2d31-a374-45e6-8ca0-ef9d173e0f96", "translation" => "Sebkhet Ouled Amara est une zone humide salée et un site d'une beauté naturelle singulière, avec des sols salins et une flore adaptée à ces conditions. Il abrite également une riche avifaune, en particulier les oiseaux migrateurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cfbf4d4b-71c6-4249-a8d0-967510fc40fa", "translation" => "سبخت أولاد عمارة هي منطقة رطبة مالحة وموقع طبيعي ذو جمال فريد، مع ترب أملاح ونباتات متكيفة مع هذه الظروف. كما أنها تستضيف أغنى طيور المنطقة، خاصة الطيور المهاجرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //673
            ["id" => "fe59f641-c6f4-4cbb-9cb1-a1ae6c7dfcc3", "translation" => "The Cedias mausoleum stands at a height of approximately 7 meters, and its structure forms a hexagon resting on two tiers. It exhibits a sturdy and imposing architecture, reflecting the significance of this monument in Roman times.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b3f95413-0702-493a-bbf1-5eb1e57c648f", "translation" => "Le mausolée de Cedias est d'une hauteur d'environ 7 mètres et sa structure forme un hexagone reposant sur deux degrés. Il présente une architecture solide et imposante, témoignant de l'importance de ce monument à l'époque romaine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a1b23733-53db-4109-b0e7-8575abc378c3", "translation" => "ضريح سيدياس يبلغ ارتفاعه حوالي 7 أمتار وهياكله تشكل سداسي مستند على طبقتين. إنه يعرض هندسة متينة ومهيمنة، تعكس أهمية هذا النصب في العصور الرومانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //674
            ["id" => "5439f9a2-6e34-4c30-8044-a09833dfa515", "translation" => "This mosque is rightly considered a rare masterpiece in the mountainous region where it is located. Its historical and cultural significance makes it a place of interest for visitors interested in ancient architecture and the heritage of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7b1e6655-d02f-4c81-8ae3-877fe7b8968b", "translation" => "Cette mosquée est considérée à juste titre comme un chef-d'œuvre rare dans la région montagneuse où elle se trouve. Son importance historique et culturelle en fait un lieu d'intérêt pour les visiteurs intéressés par l'architecture ancienne et l'héritage de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "831afd4f-8f9d-41fd-8450-e942d5e28a94", "translation" => "هذا المسجد يُعتبر بحق تحفة نادرة في المنطقة الجبلية حيث يقع. أهميته التاريخية والثقافية تجعله مكانًا مثيرًا للاهتمام بالنسبة للزوار الذين يهتمون بالهندسة المعمارية القديمة وتراث المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //675
            ["id" => "ee1830a1-a064-48b7-86fe-78b79dd846e7", "translation" => "This garden serves as a gathering place for local residents and visitors, providing an outdoor leisure and relaxation space.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9e87d646-b094-4a76-954b-5dbb392ea5da", "translation" => "Ce jardin est un lieu de rassemblement pour les habitants locaux et les visiteurs, offrant un espace de loisirs et de détente en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9424ebd9-fbc9-4d11-a3fb-6550cf17d869", "translation" => "هذه الحديقة مكان للاجتماع للمقيمين المحليين والزوار، وتوفير مساحة للترفيه والاسترخاء في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //676
            ["id" => "cb5c2428-6f2b-49ab-965e-128c10e96279", "translation" => "The museum of the mujahid in Khenchela aims to preserve the memory of the national heroes who fought for Algeria's independence. It allows visitors to gain a better understanding of the history of the struggle for freedom and to pay tribute to the sacrifices of the mudjahideen.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a663ec58-aa19-4cc2-a30f-25af57a0bfa7", "translation" => "Le musée du Moudjahid de Khenchela vise à préserver la mémoire des héros nationaux qui se sont battus pour l'indépendance de l'Algérie. Il permet aux visiteurs de mieux comprendre l'histoire de la lutte pour la liberté et de rendre hommage aux sacrifices des Moudjahidine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b7c6186b-6c5b-4d40-8af6-df21506952eb", "translation" => "متحف المجاهد في خنشلة يهدف إلى الحفاظ على ذاكرة الأبطال الوطنيين الذين قاتلوا من أجل استقلال الجزائر. إنه يتيح للزوار فهم أفضل لتاريخ النضال من أجل الحرية وتقديم الاحترام لتضحيات المجاهدين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //677
            ["id" => "bfb4100f-ddfd-49c3-b728-82bb7467ebbd", "translation" => "The Msara waterfalls are a true natural treasure, offering a picturesque and refreshing getaway in the Khenchela region. Whether it's for rejuvenating in nature, engaging in outdoor activities, or simply admiring the beauty of the waterfalls, this enchanting place is sure to captivate nature enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "17cc4328-6e23-4517-96c8-5ecbd7815a0d", "translation" => "Les cascades de Msara sont un véritable trésor naturel offrant une escapade pittoresque et rafraîchissante dans la région de Khenchela. Que ce soit pour se ressourcer au contact de la nature, pour pratiquer des activités de plein air ou simplement pour admirer la beauté des cascades, cet endroit enchanteur ne manquera pas de séduire les amateurs de paysages naturels.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8c09c7a8-3add-4959-a38a-0722cb3aecb6", "translation" => "الشلالات أمصارة كنز طبيعي حقيقي يقدم فرصة للاستمتاع برحلة جميلة ومنعشة في منطقة خنشلة. سواء كنت تبحث عن استعادة نشاطك في الطبيعة أو لممارسة الأنشطة في الهواء الطلق أو حتى لمجرد التمتع بجمال الشلالات، هذا المكان الساحر سيأسر بالتأكيد عشاق الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //678
            ["id" => "b091f166-8c71-48bc-be41-2e2300a92318", "translation" => "The Zibans gardens offer a complete entertainment experience, combining thrilling water attractions with picturesque themed gardens. This tourist complex is a true gem for the region of Biskra and serves as an ideal destination for families and water leisure enthusiasts seeking a refreshing and entertaining getaway.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a440b4e6-168c-4224-bcf2-d0095c168f47", "translation" => "Les Jardins des Zibans offrent une expérience de divertissement complète, combinant des attractions aquatiques passionnantes avec des jardins à thème pittoresques. Ce complexe touristique représente un véritable joyau pour la région de Biskra et constitue une destination idéale pour les familles et les amateurs de loisirs aquatiques à la recherche d'une escapade rafraîchissante et divertissante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "014fc87c-ceac-4eb8-8a55-0a809cadcf9a", "translation" => "حدائق الزيبان تقدم تجربة ترفيهية كاملة، حيث تجمع بين مناطق مائية مثيرة مع حدائق موضوعية خلابة. يُعتبر هذا المجمع السياحي جوهرة حقيقية في منطقة بسكرة ويعتبر وجهة مثالية للعائلات وعشاق الترفيه على الماء الباحثين عن إجازة منعشة وممتعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //679
            ["id" => "17e54b2f-164d-4712-b7d2-9618c2c288dd", "translation" => "This historic garden represents a true botanical treasure and a testament to the species acclimatization work carried out by Count Landon. It is also a popular relaxation and leisure spot for the residents and visitors of Biskra, offering an enchanting setting to rejuvenate amidst lush and diverse vegetation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9dc0f0d3-cdfa-4265-a08b-8b8e62f311cf", "translation" => "Ce jardin historique représente une véritable richesse botanique et un témoignage du travail de l'acclimatation des espèces réalisé par le comte Landon. Il constitue également un lieu de détente et de promenade très apprécié des habitants et des visiteurs de Biskra, offrant un cadre enchanteur pour se ressourcer au milieu d'une végétation luxuriante et variée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fc1a96b2-db9d-4ca9-97aa-f7c850c740b1", "translation" => "هذه الحديقة التاريخية تمثل ثروة نباتية حقيقية وشهادة على عمل تكييف الأنواع الذي أجراه الكونت لاندون. إنها أيضًا مكانًا شعبيًا للاسترخاء والترفيه لسكان بسكرة والزوار، حيث توفر بيئة ساحرة للاسترخاء في وسط نباتات غنية ومتنوعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //680
            ["id" => "baaea546-44b9-495d-8d0b-5e338ce31ff8", "translation" => "This garden serves as a peaceful oasis in the heart of Biskra city. It provides residents and visitors with a natural space where they can relax, admire the beauty of the plants, and enjoy moments of tranquility and serenity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bebb78bc-72e6-45a2-a034-7f2cf6ddb320", "translation" => "Ce jardin constitue un havre de paix au cœur de la ville de Biskra. Il offre aux résidents et aux visiteurs un espace naturel où ils peuvent se détendre, admirer la beauté des plantes et profiter de moments de calme et de quiétude.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5a30f5e0-9039-4546-9c6b-23ff00ac03ac", "translation" => "هذه الحديقة تعتبر واحة سلام في قلب مدينة بسكرة. إنها توفر للمقيمين والزوار مساحة طبيعية حيث يمكنهم الاسترخاء والتمتع بجمال النباتات والاستمتاع بلحظات من الهدوء والسكينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //681
            ["id" => "b157f20a-aedd-48a3-83a6-08ac00f0a3dc", "translation" => "The Zidane Brahim garden is a green and peaceful space, perfect for relaxation and rejuvenation. It provides a pleasant atmosphere conducive to walking and contemplation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0596c1f2-2b59-4622-a864-b209900c7e5e", "translation" => "Le jardin Zidane Brahim est un espace verdoyant et paisible, idéal pour se détendre et se ressourcer. Il offre une atmosphère agréable propice à la promenade et à la contemplation.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "062613c1-62e9-40f3-a616-68eb0e87f8eb", "translation" => "حديقة زيدان ابراهيم مكان خضراء هادئ و مثالي للاسترخاء واستعادة النشاط. إنها توفر أجواءً لطيفة مناسبة للمشي والتأمل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //682
            ["id" => "c1fb13e5-682e-4612-8bdc-62b2a921446e", "translation" => "By visiting this museum, visitors have the opportunity to delve into the history of the struggle for Algeria's freedom, better understand the sacrifices made by the mujahideen, and pay tribute to their courage and determination.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f45c20c2-87ec-4cf2-b656-9e0f191dce44", "translation" => "En visitant ce musée, les visiteurs ont l'opportunité de se plonger dans l'histoire de la lutte pour la liberté de l'Algérie, de mieux comprendre les sacrifices consentis par les moudjahidine et de rendre hommage à leur courage et à leur détermination.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8628be11-e0c8-4979-9cc0-3bb81b5cddc9", "translation" => "بزيارة هذا المتحف، يتاح للزوار فرصة الغوص في تاريخ النضال من أجل حرية الجزائر، وفهم أفضل للتضحيات التي قدمها المجاهدين، وتقديم الاحترام لشجاعتهم وعزيمتهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //683
            ["id" => "b49695e7-0eff-4536-9195-60b89227603f", "translation" => "The Biskra theater is a gathering and exchange space where spectators can enjoy artistic performances, discover new forms of expression, and participate in enriching cultural events. It contributes to the cultural diversity and artistic flourishing of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "965c3354-1cd0-40e1-a1b4-ca3376809462", "translation" => "Le théâtre de Biskra est un lieu de rassemblement et d'échange où les spectateurs peuvent profiter de performances artistiques, découvrir de nouvelles formes d'expression et participer à des événements culturels enrichissants. Il contribue ainsi à la diversité culturelle et à l'épanouissement artistique de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ac84b73f-0be8-4d13-824a-09726362000e", "translation" => "مسرح بسكرة هو مكان للتجمع والتبادل حيث يمكن للمشاهدين الاستمتاع بالعروض الفنية واكتشاف أشكال جديدة من التعبير والمشاركة في فعاليات ثقافية غنية. إنه يسهم بذلك في تعدد الثقافات وازدهار الفن في المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //684
            ["id" => "f8a9b708-09bd-426c-bd9b-3377d6f1f53b", "translation" => "The freedom square is a dynamic place, a convergence point of the city's social, cultural, and commercial life, providing a space for living and exchanging for the local community and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8e8237c6-841d-43d9-956f-e731ffdb243d", "translation" => "La place de la liberté est un lieu dynamique, un point de convergence de la vie sociale, culturelle et commerciale de la ville, offrant un espace de vie et d’échange pour la communauté locale et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8bf3b4e6-f361-405a-84d2-8d5aaa8a2cc9", "translation" => "ساحة الحرية هي مكان دينامي ونقطة اجتماع للحياة الاجتماعية والثقافية والتجارية في المدينة، وتوفير مساحة للعيش والتبادل للمجتمع المحلي والزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //685
            ["id" => "05623b8f-688d-44d0-89fb-eb2e07263b5b", "translation" => "The chamber of crafts and trades of Biskra plays an essential role in preserving the local artisanal heritage by providing support to artisans and showcasing their creations. It is a must-visit place to discover the richness and diversity of the region's craftsmanship.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "effb7cc8-8f17-46be-b810-b427e8c73f06", "translation" => "La Chambre de l'artisanat et des métiers de Biskra joue un rôle essentiel dans la préservation du patrimoine artisanal local, en offrant un soutien aux artisans et en valorisant leurs créations. Elle constitue un lieu incontournable pour découvrir la richesse et la diversité de l'artisanat de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "85f7fbef-da8f-41ff-8038-6b44af37dd44", "translation" => "غرفة الصناعة والحرف في بسكرة تلعب دورًا أساسيًا في الحفاظ على التراث الحرفي المحلي، من خلال تقديم الدعم للحرفيين وعرض إبداعاتهم. إنها مكان لا بد منه لاكتشاف ثراء وتنوع صناعة الحرف في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //686
            ["id" => "a83f1ac1-c8f5-4ded-bf51-2b7544bfa785", "translation" => "Despite the lack of current performances, the open-air theater of Biskra remains a place that embodies the cultural potential of the region. Its architecture and atmosphere create a unique ambiance for artistic events.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "138588cf-d8d1-4292-8ffc-d9910cdffeea", "translation" => "Malgré le manque de représentations actuelles, le théâtre en plein air de Biskra reste un lieu qui incarne le potentiel culturel de la région. Son architecture et son atmosphère créent une ambiance unique pour les événements artistiques", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "10f34675-7e9b-46c1-93e2-da12edfde4f4", "translation" => "على الرغم من عدم وجود عروض حالية، يظل مسرح الهواء الطلق في بسكرة مكانًا يجسد الإمكانات الثقافية للمنطقة. تصميمه المعماري وأجواؤه يخلقان أجواء فريدة للفعاليات الفنية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //687
            ["id" => "81cc3256-3d95-4cb0-a659-2770eebd77e4", "translation" => "The Biskra house of culture is an iconic venue dedicated to the promotion and dissemination of culture in the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "23499721-4aa9-48f0-9d5f-7056d363d5e4", "translation" => "La maison de la culture de Biskra est un lieu emblématique dédié à la promotion et à la diffusion de la culture dans la ville", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2e43c5df-3905-4a45-b390-f4b17ca4cb5f", "translation" => "دار الثقافة ببسكرة هو مكان رمزي مخصص لتعزيز ونشر الثقافة في المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //688
            ["id" => "3813742d-1b77-45e5-88da-acb4f22a47e1", "translation" => "The Biskra zoological park is a place where visitors can discover the beauty of wildlife, learn about the diversity of animal species, and become aware of the importance of nature conservation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5645c083-fc27-4702-b244-2507d5d33037", "translation" => "Le parc zoologique de Biskra est un lieu où les visiteurs peuvent découvrir la beauté de la faune, en apprendre davantage sur la diversité des espèces animales et prendre conscience de l'importance de la préservation de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a05c0fb5-16ed-4d7c-85f3-4e5ff817e325", "translation" => "حديقة الحيوانات بسكرة هي مكان يمكن للزوار اكتشاف جمال الحياة البرية، والتعرف على تنوع الأنواع الحيوانية، وتوعية الناس بأهمية الحفاظ على الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //689
            ["id" => "33d54b35-1eea-4337-a909-6c6930be7888", "translation" => "The gorges of el Kantara are not only a place of exceptional natural beauty, but they also hold historical significance. The area is filled with Roman ruins and archaeological sites, bearing witness to the ancient presence of the Roman civilization in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6ef6e3d1-8820-4e1d-932d-08fbf623d35d", "translation" => "Les gorges d'el Kantara sont non seulement un lieu d'une beauté naturelle exceptionnelle, mais elles ont également une importance historique. La région regorge de vestiges romains et de sites archéologiques, témoignant de l'ancienne présence de la civilisation romaine dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dc7d182f-7121-46e9-87ee-3467a6af82aa", "translation" => "مضائق القنطرة ليست فقط مكانًا ذا طبيعة استثنائية، بل لها أهمية تاريخية أيضًا. المنطقة مليئة بآثار رومانية ومواقع أثرية، تشهد على وجود الحضارة الرومانية القديمة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //690
            ["id" => "1113ebb1-a77a-46e0-9efa-dae6940ea904", "translation" => "Whether you're an avid angler seeking new experiences or simply looking for peace and tranquility, the gazelles fountain dam promises you a rejuvenating stay in the pristine nature of Biskra.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bc8b4d2f-6c3b-4b12-b1a4-52e007309e76", "translation" => "Que vous soyez un passionné de pêche à la recherche de nouvelles expériences ou simplement en quête de calme et de tranquillité, le barrage Fontaine des Gazelles vous promet un séjour ressourçant au cœur de la nature préservée de Biskra.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "902ab638-82f9-4966-97c5-b5d0627acba5", "translation" => "سواء كنت عاشقًا لصيد الأسماك تبحث عن تجارب جديدة أم مجردًا تبحث عن السكينة والهدوء، سد منبع الغزلان يعد لك بإقامة مستجدة في قلب طبيعة بسكرة الخالية من الإضرار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //691
            ["id" => "8f2a9e4f-3eb7-42f0-a260-96084c9434cb", "translation" => "Whether you're a history enthusiast, a curious soul seeking cultural discoveries, or simply interested in the life and legacy of the Colonel Si el Haoues, this museum in Biskra is a must-visit. Come and explore this knowledge-rich and emotionally engaging space, and let yourself be transported into the fascinating world of this remarkable man.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "485c9ef3-ca94-4867-885b-181f2831e756", "translation" => "Que vous soyez un passionné d'histoire, un curieux en quête de découvertes culturelles ou tout simplement intéressé par la vie et l'héritage du colonel Si el Haouès, ce musée à Biskra est un incontournable. Venez découvrir cet espace riche en connaissances et en émotions, et laissez-vous transporter dans l'univers fascinant de cet homme d'exception.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "58d99d28-ace3-46dc-bedb-6c7533283d6a", "translation" => "سواء كنت عاشقًا للتاريخ أو نفسًا فضولية تبحث عن اكتشافات ثقافية أو مجردًا مهتمًا بحياة وإرث العقيد سي الحواس، هذا المتحف في بسكرة هو وجهة لا بد منها. تعال واستكشف هذا المكان الغني بالمعرفة والمثير عاطفيًا، واسمح لنفسك بالانغماس في عالم هذا الرجل الاستثنائي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //692
            ["id" => "a6b04579-06be-4f58-a532-852d7962d222", "translation" => "While there is limited information available about the archaeological site of Bades, its mere presence sparks interest and a desire to learn more. For archaeology enthusiasts and curious explorers, this site presents a unique opportunity to delve into the past and uncover traces of a forgotten civilization.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c44b47b2-7cb2-4b43-95fa-a26c2ace095b", "translation" => "Bien qu'il y ait peu d'informations disponibles sur le site archéologique de Bades, sa présence seule suscite l'intérêt et l'envie d'en savoir plus. Pour les passionnés d'archéologie et les explorateurs curieux, ce site offre une opportunité unique de se plonger dans le passé et de découvrir les traces d'une civilisation oubliée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a16aa27c-f2b3-4758-b294-01c41f1acac7", "translation" => "على الرغم من قلة المعلومات المتاحة عن الموقع الأثري لبادس، فإن وجوده وحده يثير الاهتمام والرغبة في معرفة المزيد. بالنسبة لهواة الآثار والمستكشفين الفضوليين، يقدم هذا الموقع فرصة فريدة للغوص في الماضي واكتشاف آثار حضارة مُنسية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //693
            ["id" => "a15e64a2-193b-414f-8954-f033c1e44fc4", "translation" => "The Roman bridge of el Kantara is an architectural gem that invites visitors to step back in time and discover the ingenuity of the Romans. Whether for its historical significance, visual charm, or breathtaking views, this bridge is a must-visit attraction for history enthusiasts and curious individuals seeking beauty and tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7eb299dc-b92a-4ce5-ab3a-b3c110f9ad9b", "translation" => "Le pont romain d'el Kantara est un joyau architectural qui invite les visiteurs à remonter le temps et à découvrir l'ingéniosité des Romains. Que ce soit pour son aspect historique, son charme visuel ou sa vue imprenable, ce pont constitue une attraction incontournable pour les amateurs d'histoire et les curieux en quête de beauté et de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5cc0956a-84c7-41b9-b737-51602dab5900", "translation" => "جسر القنطرة الروماني هو جوهرة معمارية تدعو الزوار للعودة في الزمن واكتشاف ذكاء الرومان. سواء كان السبب تاريخه الهام، سحره البصري، أو مناظره الخلابة، يُعتبر هذا الجسر جاذبية لا بد من زيارته لعشاق التاريخ والفضوليين الذين يبحثون عن الجمال والهدوء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //694
            ["id" => "232e4b81-6bda-435d-979a-ee8facceaf69", "translation" => "Built in 686, the mosque of Sidi Okba is a remarkable example of Islamic architecture from that era. It has become a cultural and spiritual treasure that attracts visitors seeking a connection with history, religion, and architectural beauty. It's a place where tradition intertwines with faith, offering a unique and enriching experience for all who visit.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "45ebd11c-fee4-4c42-82aa-f36501e743fb", "translation" => "Construite en 686, la mosquée de Sidi Okba est un exemple remarquable de l'architecture islamique de l'époque. Elle deviendra un trésor culturel et spirituel qui attire les visiteurs en quête de connexion avec l'histoire, la religion et la beauté architecturale. C'est un lieu où la tradition se mêle à la foi, offrant une expérience unique et enrichissante pour tous ceux qui la visitent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9afbd8c6-2ed7-4a5b-a9f0-28b7895d0072", "translation" => "بُني المسجد في عام 686، وهو مثال ملحوظ على العمارة الإسلامية من تلك الحقبة. أصبح مكنزًا ثقافيًا وروحيًا يجذب الزوار الذين يبحثون عن ارتباط بالتاريخ والدين وجمال العمارة. إنه مكان حيث تتداخل التقاليد مع الإيمان، مما يقدم تجربة فريدة ومثيرة لجميع الذين يزورونه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //695
            ["id" => "7d95e099-bc66-473a-9a69-91e739d63775", "translation" => "Whether for an adventurous hike, a photographic exploration, or simply to bask in the natural beauty, the M'chouneche gorges are a must-visit for nature enthusiasts and travelers seeking unique discoveries.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "669c3305-33a0-4204-a5eb-f5ff39dea4f0", "translation" => "Que ce soit pour une randonnée aventureuse, une exploration photographique ou simplement pour profiter de la beauté naturelle, les gorges de M'chouneche sont un incontournable pour les amateurs de nature et les voyageurs en quête de découvertes uniques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3df7d199-e2f1-4f2a-9b24-25493daf3837", "translation" => "سواء كنت تبحث عن رحلة مغامرة، استكشاف تصويري، أو مجرد الاستمتاع بجمال الطبيعة، فإن مضائق مشونش هي وجهة لا غنى عنها لعشاق الطبيعة والمسافرين الذين يبحثون عن اكتشافات فريدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //696
            ["id" => "ebf0b1ad-13ae-4ab4-bd2e-4b1d6ab91269", "translation" => "The archaeological site of Gemellae provides a unique opportunity to explore and appreciate Roman history. It is a place of interest for archaeology enthusiasts and history buffs seeking fascinating discoveries about the Roman civilization in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "56a0c017-faba-421a-b929-5f8db4ac348a", "translation" => "Le site archéologique de Gemellae offre une occasion unique d'explorer et d'apprécier l'histoire romaine. C'est un lieu d'intérêt pour les passionnés d'archéologie et les amateurs d'histoire en quête de découvertes fascinantes sur la civilisation romaine dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9a696064-2822-49ae-8b01-6610705969bb", "translation" => "يوفر موقع جيملاي الأثري فرصة فريدة لاستكشاف وتقدير التاريخ الروماني. إنه مكان مثير للاهتمام لعشاق علم الآثار وهواة التاريخ الذين يبحثون عن اكتشافات رائعة حول الحضارة الرومانية في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //697
            ["id" => "188e46f5-3265-487b-a05d-92bc3fe68b80", "translation" => "Gueltet Ourelal is not only a place of natural beauty but also an ideal spot to recharge and reconnect with nature, whether it's for a relaxing day with family, an outdoor excursion, or simply to enjoy the serenity of the place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b6a035c4-f5f9-45df-b812-84ad4a75dab2", "translation" => "Gueltet Ourelal est non seulement un lieu de beauté naturelle, mais aussi un endroit idéal pour se ressourcer et se reconnecter avec la nature. Que ce soit pour une journée de détente en famille, une excursion en plein air ou simplement pour profiter de la sérénité de l'endroit.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "eb8c0dc4-551c-414d-a61f-97bbd85d11f5", "translation" => "قلتة اورلال ليست مكانًا فقط للجمال الطبيعي، بل هي أيضًا نقطة مثالية لإعادة الشحن وإعادة الاتصال مع الطبيعة، سواء كان ذلك لقضاء يوم استرخاء مع العائلة، أو نزهة في الهواء الطلق، أو ببساطة للاستمتاع بسكينة المكان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //698
            ["id" => "e07f6f6b-1e3e-48a8-92b8-c3f045c56626", "translation" => "The Golden amusement park is the perfect place to spend a fun day with family or friends, enjoy thrilling moments and laughter, and create unforgettable memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "50488248-2677-4cda-bafc-aadd02c3507c", "translation" => "Le parc d'attractions Golden Park est l'endroit idéal pour passer une journée amusante en famille ou entre amis, profiter de moments de frissons et de rires, et créer des souvenirs inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4b9fec32-521b-406f-8b66-139905f9dcff", "translation" => "متنزه جولدن بارك هو المكان المثالي لقضاء يوم ممتع مع العائلة أو الأصدقاء، والاستمتاع بلحظات مثيرة وضحك، وخلق ذكريات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //699
            ["id" => "9d787a9e-0c6b-4cec-9d37-8760a14e1802", "translation" => "The Caracalla gate is a remarkable testament to Roman architecture and the influence of the empire in the region. By visiting it, visitors will have the opportunity to closely admire the artistic details and ornaments that have withstood the test of time, while immersing themselves in the history and grandeur of the Roman Empire.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0cbcd053-0d14-4b1b-89ae-cf6f0599be57", "translation" => "La porte de Caracalla est un témoignage remarquable de l'architecture romaine et de l'influence de l'empire dans la région. En la visitant, les visiteurs auront l'occasion d'admirer de près les détails artistiques et les ornements qui ont résisté à l'épreuve du temps, tout en se plongeant dans l'histoire et la grandeur de l'empire romain.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fda0258f-1d02-470f-a093-f42ff0701e6b", "translation" => "باب كركلا هي شاهد ملموس على العمارة الرومانية وتأثير الإمبراطورية في المنطقة. عند زيارتها، سيكون لدى الزوار فرصة التمتع بقرب النظر إلى التفاصيل الفنية والزخارف التي صمدت أمام اختبار الزمن، بينما يغمرون أنفسهم في تاريخ وعظمة الإمبراطورية الرومانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //700
            ["id" => "5d77a37d-44b8-4d66-a367-7e141be77c79", "translation" => "The Saint Crispin's basilica is a site of historical and archaeological interest where visitors can explore the remains of this ancient basilica and immerse themselves in the history of early Christianity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4d1d8d96-93be-48b6-811f-c1b917844111", "translation" => "La basilique Sainte Crispine est un site d'intérêt historique et archéologique où les visiteurs peuvent explorer les vestiges de cette ancienne basilique, se plonger dans l'histoire du christianisme primitif.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7cc18c80-c925-4b00-9fdf-026c776f96ad", "translation" => "كاتدرائية القديسة كريسبينا هي موقع ذو أهمية تاريخية وأثرية حيث يمكن للزوار استكشاف آثار هذه الكنيسة القديمة والانغماس في تاريخ المسيحية الأولى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //701
            ["id" => "eedd6731-584a-4044-a208-2eb43522109b", "translation" => "It serves as a meeting place and a forum for interaction among artists, creators, intellectuals, and the public, thus promoting cultural development and artistic diversity in the Tebessa region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "67b5f994-6c31-4ea4-9a51-b6cf50647d38", "translation" => "Elle constitue un lieu de rencontre et d'échange entre les artistes, les créateurs, les intellectuels et le public, favorisant ainsi le développement culturel et la diversité artistique de la région de Tébessa.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b5c2f24b-20e4-463e-9cfa-3becb6de0e59", "translation" => "إنها تشكل مكانًا للاجتماع وتبادل الآراء بين الفنانين والمبدعين والمثقفين والجمهور، مما يعزز بذلك التنمية الثقافية والتنوع الفني في منطقة تبسة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //702
            ["id" => "a8138ad5-2acd-431e-9def-510656cd45cb", "translation" => "The temple of Minerva is a captivating testament to the history and cultural diversity of the region, providing visitors with the opportunity to explore ancient relics and delve into the rich history of this part of Algeria.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bccd5e5b-36e2-4872-8f40-dbbd4a6b822d", "translation" => "Le temple de Minerve est un témoin fascinant de l'histoire et de la diversité culturelle de la région, offrant aux visiteurs l'occasion de découvrir des vestiges antiques et de plonger dans l'histoire riche de cette partie de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "17015b78-6493-4dce-bcff-b5b82577f89c", "translation" => "معبد مينيرفا هو شاهد رائع على تاريخ وتنوع الثقافة في المنطقة، مما يتيح للزوار فرصة استكشاف آثار قديمة والانغماس في تاريخ هذا الجزء الغني من الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //703
            ["id" => "50780256-3998-4bf9-84e6-fb576f32057b", "translation" => "A place where one can enjoy a moment of peace, take a break in the shade of trees, and recharge amidst nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9b6fb2c8-eef2-4bcb-9230-8c1d11a30253", "translation" => "Un lieu où l'on peut profiter d'un moment de calme, faire une pause à l'ombre des arbres et se ressourcer en pleine nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5a79445b-5db1-42cb-b6bc-6b3fda25152e", "translation" => "مكان حيث يمكن للشخص الاستمتاع بلحظة من السكينة، وأخذ استراحة في ظل الأشجار، والاستمتاع بالطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //704
            ["id" => "b205b547-010f-41e2-9799-561d2d6fbf88", "translation" => "The remains of ancient Theveste offer visitors a fascinating glimpse into daily life in ancient Rome. By exploring this historical site, one can imagine the activity and grandeur that once thrived in this flourishing city. It's an immersive experience that allows you to step back in time and discover the wonders of Roman architecture and civilization.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c25094c9-ed9f-4829-9482-6e9930c37b7d", "translation" => "Les vestiges de l'antique Theveste offrent aux visiteurs un aperçu fascinant de la vie quotidienne dans la Rome antique. En explorant ce site historique, on peut imaginer l'activité et la splendeur qui régnaient autrefois dans cette ville florissante. C'est une expérience immersive qui permet de remonter le temps et de découvrir les merveilles de l'architecture et de la civilisation romaines.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d8c5e345-23f4-4781-8b5c-bc7b25da4a7c", "translation" => "بقايا مدينة تيفاست القديمة تقدم للزوار لمحة ساحرة عن الحياة اليومية في روما القديمة. من خلال استكشاف هذا الموقع التاريخي، يمكن للشخص أن يتخيل النشاط والعظمة التي كانت مزدهرة في هذه المدينة. إنها تجربة غامرة تسمح لك بالعودة إلى الزمن واكتشاف عجائب العمارة والحضارة الرومانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //705
            ["id" => "8c3fccf5-3fc0-4686-bce8-8cd3fc85dd95", "translation" => "The Roman amphitheater of Tebessa is a remarkable site that allows visitors to immerse themselves in the history of ancient Rome. The imposing dimensions of the amphitheater bear witness to the grandeur and architectural genius of the Roman era.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b8e60978-b49c-4999-b449-9fb233c1fe23", "translation" => "L'amphithéâtre romain de Tébessa est un site remarquable qui permet aux visiteurs de se plonger dans l'histoire de la Rome antique. Les dimensions imposantes de l'amphithéâtre témoignent de la grandeur et du génie architectural de l'époque romaine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5f320923-15c3-47ea-9ca6-463c93aa0127", "translation" => "مدرج تبسة الروماني هو موقع ملحوظ يسمح للزوار بانغماس أنفسهم في تاريخ روما القديم. الأبعاد الضخمة للمدرج تشهد على عظمة وعبقرية الهندسة في عصر الرومان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //706
            ["id" => "bcc31d96-f543-4b39-9f84-b68439760b99", "translation" => "The el Atik mosque is an iconic place that embodies the history and spirituality of Tebessa. Its imposing presence and distinctive architectural elements are a testament to the rich Islamic tradition in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cc12b8cf-8a21-407e-868e-74426e3dcddf", "translation" => "La mosquée el Atik est un lieu emblématique qui incarne l'histoire et la spiritualité de Tébessa. Sa présence imposante et ses éléments architecturaux distinctifs témoignent de la riche tradition islamique dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b26aa04a-0927-4baf-aa0d-14a536aabadd", "translation" => "مسجد العتيق هو مكان رمزي يجسد تاريخ وروحانية تبسة. وجوده الرائع وعناصره المعمارية المميزة يشهدان على التقليد الإسلامي الغني في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //707
            ["id" => "c650dc04-efe1-4aaa-b12d-4e690c1bba3b", "translation" => "It is an ideal place for history enthusiasts, archaeology enthusiasts, and anyone wishing to explore the cultural heritage of Tebessa. The archaeological garden provides an immersive experience that combines nature, art, and history, creating a unique space where the past and present harmoniously converge.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "08aa0c88-28d4-4021-8ca3-b80da90c566c", "translation" => "C'est un lieu idéal pour les amateurs d'histoire, les passionnés d'archéologie et tous ceux qui souhaitent découvrir le patrimoine culturel de Tébessa. Le jardin archéologique offre une expérience immersive qui combine la nature, l'art et l'histoire, créant ainsi un espace unique où le passé et le présent se rencontrent harmonieusement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "94a664d1-5a29-4f3d-818c-513e21b5eb82", "translation" => "إنه مكان مثالي لعشاق التاريخ وعشاق الآثار وجميع أولئك الذين يرغبون في استكشاف التراث الثقافي لتبسة. تقدم الحديقة الأثرية تجربة غامرة تجمع بين الطبيعة والفن والتاريخ، مما يخلق مكانًا فريدًا حيث يتلاقى الماضي والحاضر بانسجام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //708
            ["id" => "2ba40004-313f-4dce-b438-63d9f00ec61e", "translation" => "The museum of the ancient church of Tebessa is a historically significant location housed in a building dating back to 1885, originally constructed for the resident Christian community of Tebessa. However, in 1971, this building was converted into an antiquities museum, housing an extensive collection of ancient artifacts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d08d1099-82b7-4bc7-9171-fa8722fc3d1e", "translation" => "Le musée de l'ancienne église de Tébessa est un lieu chargé d'histoire situé dans un bâtiment datant de 1885, construit à l'origine pour la communauté chrétienne résidente de Tébessa. Cependant, en 1971, ce bâtiment a été transformé en musée d'antiquités, abritant une vaste collection d'objets anciens.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "82c0793a-3672-4f70-ac11-c9a3f3de391d", "translation" => "متحف الكنيسة القديمة في تبسة هو مكان ذو تاريخ غني يوجد في مبنى يعود تاريخه إلى عام 1885، تم بناؤه في الأصل للجالية المسيحية المقيمة في تبسة. ومع ذلك، في عام 1971، تم تحويل هذا المبنى إلى متحف للآثار، حيث يضم مجموعة واسعة من القطع الأثرية القديمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //709
            ["id" => "0f09db1f-87c3-49e6-9b45-ef339ccc2275", "translation" => "The Byzantine wall of Tébessa is an impressive testament to the military architecture of the time and reflects the strategic importance of the city. Today, it serves as a remarkable archaeological site and a major point of interest for visitors seeking historical discoveries.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a1306d96-594e-42a7-a26d-823d2fc9bbe6", "translation" => "La muraille byzantine de Tébessa est un témoignage impressionnant de l'architecture militaire de l'époque et témoigne de l'importance stratégique de la ville. Aujourd'hui, elle constitue un site archéologique remarquable et un point d'intérêt majeur pour les visiteurs en quête de découvertes historiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c3b2f1c8-c83d-4006-a15d-187a62682631", "translation" => "سور تبسة البيزنطي هو شاهد مذهل على الهندسة العسكرية في تلك الفترة ويعكس أهمية المدينة من الناحية الاستراتيجية. اليوم، يعتبر موقعًا أثريًا ملفتًا ونقطة جذب رئيسية للزوار الباحثين عن اكتشافات تاريخية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //710
            ["id" => "00531af4-3261-4892-85c7-b64383d479c5", "translation" => "The Berber tower of Djebel Mestiri is a valuable witness to the history of the region, providing insights into the surveillance and defense strategies employed by local populations against various powers that have occupied the area over the centuries. It represents a remarkable cultural and architectural heritage that deserves to be preserved and celebrated.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4552c926-1a49-4dc4-820d-58bcdd36cb21", "translation" => "La tour berbère de djebel Mestiri est un témoin précieux de l'histoire de la région, offrant un aperçu des stratégies de surveillance et de défense mises en place par les populations locales face aux différentes puissances qui ont occupé la région au fil des siècles. Elle représente un patrimoine culturel et architectural remarquable qui mérite d'être préservé et valorisé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "951f250f-0039-49b5-b020-ac4bdfac009d", "translation" => "برج جبل مستيري الأمازيغي هو شاهد قيم على تاريخ المنطقة، حيث يقدم نظرة على استراتيجيات المراقبة والدفاع التي اعتمدتها السكان المحليين ضد مختلف القوى التي احتلت المنطقة على مر العصور. إنه يمثل تراثًا ثقافيًا ومعماريًا ملحوظًا يستحق الحفاظ عليه والترويج له.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //711
            ["id" => "2c84a0d2-ccc0-41b9-ad9a-7f56385072d5", "translation" => "Whether for a leisurely stroll, a family picnic day, or outdoor recreational activities, this recreational forest provides a conducive space for relaxation and enjoyment. It represents a valuable tourist attraction for the Tebessa region, where residents and visitors alike can reap the benefits of nature and create memorable experiences.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "95c4d033-ba83-4846-9152-0d92d1cbe10d", "translation" => "Que ce soit pour une promenade tranquille, une journée de pique-nique en famille ou des activités ludiques en plein air, cette forêt récréative offre un espace propice à la détente et aux loisirs. Elle représente un attrait touristique précieux pour la région de Tébessa, où les habitants et les visiteurs peuvent profiter des bienfaits de la nature et créer des souvenirs mémorables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4d00d67d-5dba-4bf3-8198-93b893831001", "translation" => "سواء كنتم تتجولون براحة، أو تقضون يومًا في نزهة عائلية، أو تمارسون أنشطة ترفيهية في الهواء الطلق، تقدم هذه الغابة الترفيهية مساحة مناسبة للاسترخاء والتمتع. إنها تمثل جاذبية سياحية قيمة لمنطقة تبسة، حيث يمكن للسكان والزوار على حد سواء الاستفادة من فوائد الطبيعة وخلق ذكريات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //712
            ["id" => "2d75c0df-8ab9-482f-9eec-4416bec75d06", "translation" => "The mausoleums of Morsott are valuable testimonials to the history and culture of the region. They provide visitors with the opportunity to appreciate the funerary architecture of the time and immerse themselves in the fascinating past of this ancient city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1026658b-4900-4520-a92b-2ffbe164ad12", "translation" => "Les mausolées de Morsott représentent des témoignages précieux de l'histoire et de la culture de la région. Ils offrent aux visiteurs l'opportunité d'apprécier l'architecture funéraire de l'époque et de se plonger dans le passé fascinant de cette ancienne cité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1ff51731-f516-4fe1-b0a7-6efb869b1612", "translation" => "أضرحة مرسط تمثل شهادات قيمة على تاريخ وثقافة المنطقة. إنها تقدم للزوار فرصة لتقدير معمار الجنائز لتلك الفترة والانغماس في الماضي الرائع لهذه المدينة القديمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //713
            ["id" => "cc588afc-c019-4ec7-923c-1de9060514c7", "translation" => "The ruins of the Thevest palace are a significant testament to the city's past history. Located within the city, between the Byzantine citadel and ancient Tebessa, this site provides insight into the grandeur that characterized the era.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b56a9747-f8f4-41f0-89de-3619f18be75f", "translation" => "Les ruines du palais de Thevest sont un témoignage important de l'histoire passée de la ville. Situé à l'intérieur de la ville, entre la citadelle byzantine et la Tébessa antique, ce site offre un aperçu des splendeurs qui ont marqué l'époque.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1475e832-c850-41d5-a09a-967a5d3836b9", "translation" => "بقايا قصر تيفاست هي شهادة هامة على تاريخ المدينة في الماضي. يقع هذا الموقع داخل المدينة، بين الحصن البيزنطي وتبسة القديمة، وهو يقدم لمحة عن الروعة التي ميزت تلك الحقبة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //714
            ["id" => "2f0d6e52-eab9-447e-bba1-3c4af961b869", "translation" => "The Gouri Park is a perfect place to spend time with family or friends, creating unforgettable memories. Whether you're seeking adrenaline or simply a moment of relaxation, this amusement park offers an entertaining experience for everyone.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3edcaa90-590c-4767-8f14-b942b5b0f0f3", "translation" => "Le Gouri Park est un endroit idéal pour passer du temps en famille ou entre amis, en créant des souvenirs inoubliables. Que vous soyez à la recherche d'adrénaline ou simplement d'un moment de détente, ce parc d'attractions offre une expérience divertissante pour tous.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f08c4492-d5a5-4843-ac15-00d250391702", "translation" => "حديقة ڨوري بارك هي مكان مثالي لقضاء الوقت مع العائلة أو الأصدقاء، مما يخلق ذكريات لا تُنسى. سواء كنت تبحث عن الإثارة أو ببساطة لحظة استرخاء، يقدم هذا الحديقة الترفيهية تجربة مسلية للجميع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //715
            ["id" => "c8555ead-71a8-48db-a011-d846731aa2d4", "translation" => "This large urban garden with children's attractions is the perfect place for a family outing, providing a safe, entertaining, and educational space for the younger ones. It allows children to connect with nature, play, and socialize while enjoying a serene and pleasant environment in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8c2e0a83-ccc8-4f0c-8805-bff1e68f9899", "translation" => "Ce grand jardin en ville avec des attractions pour enfants est l'endroit idéal pour une sortie en famille, offrant un espace sûr, divertissant et éducatif pour les plus jeunes. Il permet aux enfants de se connecter avec la nature, de jouer et de socialiser tout en profitant d'un environnement serein et agréable au cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d3921217-3698-499d-90a2-b038633f6648", "translation" => "هذه الحديقة الكبيرة في المدينة هي المكان المثالي للخروج مع العائلة، حيث توفر مساحة آمنة ومسلية للصغار. إنها تسمح للأطفال بالتواصل مع الطبيعة واللعب والتفاعل الاجتماعي، مع الاستمتاع ببيئة هادئة وممتعة في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //716
            ["id" => "4ccffecd-ae9f-4aac-b28d-2ce178c26422", "translation" => "The El Oued crafts house is an iconic place located in the city. It is dedicated to the promotion and preservation of the traditional arts and crafts of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "08859983-9b28-4769-9e4c-b8541a88ad03", "translation" => "La maison de l'artisanat d'El Oued est un lieu emblématique situé dans la ville. Elle est dédiée à la promotion et à la préservation des arts et métiers traditionnels de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ffa0c069-625d-442e-8ddc-bef87d26e204", "translation" => "دار الصناعة التقليدية في الوادي هو مكان رمزي يقع في المدينة. إنه مكرس للترويج والحفاظ على الفنون والحرف التقليدية للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //717
            ["id" => "52a41fbc-0a35-425f-9dd5-53fa161ae217", "translation" => "The El Oued mujahid museum is a place of memory and celebration dedicated to the fighters of the independence war. It is a must-visit for those who wish to deepen their knowledge of Algeria's history and honor the sacrifices of the mujahideen.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a7d0d079-e877-4076-820d-234f24034f18", "translation" => "Le musée du Moudjahid d'El Oued est un lieu de mémoire et de célébration dédié aux combattants de la guerre d'indépendance. C'est un endroit incontournable pour ceux qui souhaitent approfondir leur connaissance de l'histoire de l'Algérie et honorer les sacrifices des moudjahidine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9d6d61f9-a1e3-4980-87c1-fb180b7478f8", "translation" => "متحف المجاهد بالوادي هو مكان للذاكرة والاحتفال مخصص لمجاهدين حرب الاستقلال. إنه مكان لا غنى عنه لأولئك الذين يرغبون في تعميق معرفتهم بتاريخ الجزائر وتكريم تضحيات المجاهدين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //718
            ["id" => "92a8e350-6a2c-4b51-818c-4c081ae00f90", "translation" => "The municipal museum of El Oued is a place that provides visitors with the opportunity to explore and discover the history, culture, and heritage of the region. It is a venue for the preservation, education, and celebration of the region's rich heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cf052c1f-0003-48fa-8e5f-a5892db7d679", "translation" => "Le musée communal d'El Oued est un lieu qui offre aux visiteurs l'opportunité d'explorer et de découvrir l'histoire, la culture et le patrimoine de la région. C'est un lieu de préservation, d'éducation et de célébration du riche héritage de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "156264b0-ae10-4e81-9e82-bffc20f641ff", "translation" => "المتحف البلدي في الوادي هو مكان يوفر للزوار فرصة استكشاف تاريخ وثقافة وتراث المنطقة. إنه مكان للحفاظ على التراث والتعليم والاحتفال بالإرث الغني للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //719
            ["id" => "043bc218-57a7-41d2-ba03-66ebe0afdad8", "translation" => "The martyr's memorial and its garden provide a space for commemoration. It is a place where visitors can pay tribute, remember, and contemplate the significance of sacrifice and the history of the struggle for independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3995f238-f585-49e1-807d-13c5602740cf", "translation" => "Le mémorial au martyr et son jardin offrent un espace de commémoration et de recueillement. C'est un lieu où les visiteurs peuvent rendre hommage, se souvenir et réfléchir à l'importance du sacrifice et à l'histoire de la lutte pour l'indépendance.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "52d2f542-3dff-47ff-9a5e-68e42e5c123e", "translation" => "مقام الشهيد وحديقته يوفران مساحة للتذكير والتفكير. إنه مكان حيث يمكن للزوار أن يقدموا التحية، ويتذكروا، ويتأملوا في أهمية التضحية وتاريخ النضال من أجل الاستقلال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //720
            ["id" => "5615a5f6-0b63-4354-a738-3d5953dd4e4f", "translation" => "The Guemar museum is a valuable space that showcases historical and cultural antiquities, allowing visitors to explore the lifestyle of the Souf region's families and gain a deeper understanding of the complex history of the region, including periods marked by colonialism.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aab311f1-7fcb-4661-b0ce-4268c66791bf", "translation" => "Le musée de Guemar est un espace précieux qui présente des antiquités historiques et culturelles, permettant aux visiteurs de découvrir le mode de vie de la famille de la région de Souf et de mieux appréhender l'histoire complexe de la région, y compris les périodes marquées par le colonialisme.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0e8132a3-a212-494c-8bff-60750288d473", "translation" => "متحف قمار هو مكان ثمين يعرض أثارًا تاريخية وثقافية، مما يتيح للزوار فرصة استكشاف نمط حياة عائلات منطقة السوف وفهم أفضل لتاريخ هذه المنطقة المعقد، بما في ذلك الفترات التي اتسمت بالاستعمار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //721
            ["id" => "cc4b298d-4eaa-46c9-9dad-2cfbc2b281d6", "translation" => "Chott Melghir is Algeria's largest lake and Africa's largest salt flat. With its unique landscape of vast expanses of white salt, it offers an impressive visual experience. It's a destination to visit for nature enthusiasts and those looking to discover the natural wonders of the country.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0766672b-dc3c-4bad-8191-66ca588c6580", "translation" => "Chott Melghir est le plus grand lac d'Algérie et la plus grande mine de sel d'Afrique. Avec son paysage unique de vastes étendues de sel blanc, il offre une expérience visuelle impressionnante. C'est un lieu à visiter pour les amateurs de nature et ceux qui souhaitent découvrir les merveilles naturelles du pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0ed65277-a951-4992-890d-0f478911941b", "translation" => "شط ملغيغ أكبر بحيرة في الجزائر وأكبر منجم ملح في إفريقيا. بمنظره الفريد من مساحات واسعة من الملح الأبيض، يقدم تجربة بصرية مذهلة. إنه مكان يجب زيارته لعشاق الطبيعة وأولئك الذين يتطلعون لاكتشاف عجائب الطبيعة في البلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //722
            ["id" => "fbbe8de4-6a90-47e5-9cbe-c9d81499d35f", "translation" => "El Guemira, or caravan landmarks, is a collection of distinctive markers found in the El Oued region. They played a vital role in guiding travelers through the desert and locating water points. These landmarks, with their unique pyramid-like shape, represent a valuable cultural and civilizational heritage to be preserved.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4724860d-33b9-4c6a-9b5d-bad3c0629c4d", "translation" => "El Guemira, ou les repères des caravanes, est un ensemble de repères distinctifs présents dans la région d'El Oued. Ils ont joué un rôle vital dans l'orientation des voyageurs à travers le désert et la localisation des points d'eau. Ces repères, avec leur forme pyramidale unique, représentent un patrimoine culturel et civilisationnel précieux à préserver.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "972128e4-33be-4d99-91e2-92e7dce643f7", "translation" => "الڨميرة، أو علامات القوافل، هي مجموعة من العلامات المميزة الموجودة في منطقة الوادي. لقد لعبت دورًا حيويًا في توجيه المسافرين عبر الصحراء وتحديد نقاط المياه. هذه العلامات، بشكلها الفريد الشبه بالأهرامات، تمثل تراثًا ثقافيًا وحضاريًا قيمًا يجب الحفاظ عليه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //723
            ["id" => "b1140d20-7eb0-4c55-9795-6d7931918220", "translation" => "The El Djelfa zoological park is a place where one can discover a variety of animals from different species. It's an ideal place for nature enthusiasts and animal lovers looking to learn more about local and global wildlife.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1575ce05-7f95-41c1-9d3e-441b589711d8", "translation" => "Le parc zoologique d'el Djelfa est un lieu où l'on peut découvrir une variété d'animaux provenant de différentes espèces. C'est un endroit idéal pour les amoureux de la nature et les passionnés d'animaux souhaitant en apprendre davantage sur la faune locale et mondiale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d626a0d7-a544-48f5-9746-2574bf48a59b", "translation" => "حديقة الحيوانات بالجلفة هي مكان يمكنك من خلاله اكتشاف مجموعة متنوعة من الحيوانات من مختلف الأنواع. إنها مكان مثالي لعشاق الطبيعة وعشاق الحيوانات الذين يرغبون في معرفة المزيد عن الحياة البرية المحلية والعالمية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //724
            ["id" => "e739c692-eb63-40ed-ab5b-3669a3a22572", "translation" => "The Ahmed Ben Bouzid theater is a major cultural venue in the region. With its modern infrastructure and diverse program, it provides an enriching artistic experience for both local residents and visiting audiences.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "184645c5-7d94-4f00-b610-6c07b4406e68", "translation" => "Le théâtre Ahmed Ben Bouzid est un lieu culturel majeur de la région. Avec son infrastructure moderne et son programme varié, il offre une expérience artistique enrichissante pour les habitants de la région et les visiteurs de passage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "912d0f26-e7d6-4064-a332-1b428d063c04", "translation" => "مسرح أحمد بن بوزيد هو مكان ثقافي رئيسي في المنطقة. بفضل بنيته الحديثة وبرامجه المتنوعة، يقدم تجربة فنية مثرية لسكان المنطقة والزوار العابرين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //725
            ["id" => "ec29cde0-4b6e-467e-af1e-0e53b7ee2765", "translation" => "The botanical garden is a secure public space cherished by families in the region. It provides visitors with a pleasant natural setting where they can relax in peace.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1e6fed53-bc56-4778-a5d6-debf398ce7d0", "translation" => "Le jardin botanique est un espace public sécurisé et prisé par les familles de la région. Il offre aux visiteurs un cadre naturel agréable où ils peuvent se détendre en toute tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "834da110-3edb-4868-845f-71f63623ba49", "translation" => "الحديقة النباتية هي مساحة عامة آمنة ومحببة للعائلات في المنطقة. إنها توفر للزوار بيئة طبيعية لطيفة حيث يمكنهم الاسترخاء بسلام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //726
            ["id" => "eff51e0c-8d57-4d9b-86ea-8e360582da49", "translation" => "Dar el Baroud is a military building dating back to the colonial period, once serving as a strategic observation tower. Today, it stands as a reminder of the region's military history and an important historical monument in the city center.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4e91ce6d-48e8-4729-9ddf-82befdd42317", "translation" => "Dar el Baroud est un bâtiment militaire datant de la période coloniale, servant autrefois de tour d'observation stratégique. Aujourd'hui, il est un rappel de l'histoire militaire de la région et un monument historique important dans le centre de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ec11d112-2670-4803-a05b-18e3a1985b1a", "translation" => "دار البارود هو مبنى عسكري يعود إلى فترة الاستعمار، كان يستخدم في الماضي كبرج مراقبة استراتيجي. اليوم، يعتبر تذكيرًا بالتاريخ العسكري للمنطقة ونصب تاريخي هام في وسط المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //727
            ["id" => "380f3cc3-7e57-4258-b633-762d6e275776", "translation" => "The El Djelfa house of culture is a versatile cultural space that provides a dynamic platform for artistic creation and the promotion of local culture. It is a place for gathering, entertainment, and learning, contributing to the cultural vitality of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7911b7c8-9066-477c-8162-abfb08e7853d", "translation" => "La maison de la culture d'el Djelfa est un espace culturel polyvalent qui offre une plateforme dynamique pour la création artistique et la promotion de la culture locale. C'est un lieu de rencontre, de divertissement et d'apprentissage, qui contribue à la vitalité culturelle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cf8bf7a6-16c6-4a0b-b97b-13b6ecfaf4a4", "translation" => "دار الثقافة في الجلفة هو مساحة ثقافية متعددة الاستخدامات توفر منصة ديناميكية للإبداع الفني وتعزيز الثقافة المحلية. إنه مكان للالتقاء والترفيه والتعلم، والذي يساهم في حيوية الثقافة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //728
            ["id" => "41402ca4-5d71-401d-951a-f302949724c6", "translation" => "The museum houses a diverse collection of historical objects, including prehistoric tools, ceramics, ancient coins, traditional weapons, photographs, and historical archives. These items allow visitors to explore and gain a better understanding of the rich and diverse history of El Djelfa.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "506fe249-e56e-4cda-9131-f2b286fce3bd", "translation" => "Le musée abrite une collection variée d'objets historiques, tels que des outils préhistoriques, des céramiques, des pièces de monnaie anciennes, des armes traditionnelles, des photographies et des archives historiques. Ces éléments permettent aux visiteurs d'explorer et de mieux comprendre l'histoire riche et diversifiée d'El Djelfa.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "28feb889-c21c-4122-8aa0-67801e8cda35", "translation" => "المتحف يحوي مجموعة متنوعة من الأشياء التاريخية، مثل الأدوات القديمة، والسيراميك، والعملات القديمة، والأسلحة التقليدية، والصور الفوتوغرافية، والأرشيف التاريخي. تتيح هذه العناصر للزوار استكشاف وفهم أفضل للتاريخ الغني والمتنوع للجلفة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //729
            ["id" => "86aebbd7-5f30-44c7-9a47-24ee708b7e67", "translation" => "The liberty garden is a true oasis of peace in the midst of the city. It embodies the beauty of nature and provides a space for relaxation and leisure for all those seeking a moment of peace and serenity in the open air.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ddf7b9df-ca8c-445a-9a20-b1194bcda3e3", "translation" => "Le jardin de la liberté est un véritable havre de paix au milieu de la ville. Il incarne la beauté de la nature et offre un espace de détente et de loisirs pour tous ceux qui cherchent un moment de calme et de sérénité en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "052b9d2e-8633-4e47-a435-ddc3b06a440d", "translation" => "حديقة الحرية هي واحة حقيقية للسلام في وسط المدينة. إنها تجسد جمال الطبيعة وتوفر مكانًا للاسترخاء والترفيه لجميع الذين يبحثون عن لحظة من الهدوء والسكينة في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //730
            ["id" => "08701f5c-6d1f-40e4-b8ff-2b8f85dd7cb2", "translation" => "The Sidi Naïl racecourse is a place filled with history and emotions. Located in a picturesque setting at the foot of the Saharan Atlas, it enjoys a privileged location in the heart of the Algerian highlands.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0cad87cd-09aa-42d2-a8c9-2cee7f81495b", "translation" => "L'hippodrome Sidi Naïl est un lieu chargé d'histoire et d'émotions. Situé dans un cadre pittoresque au pied de l'Atlas saharien, il bénéficie d'un emplacement privilégié au cœur des hauts-plateaux algériens.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "34cd72b1-2518-44ea-84ab-b3d1ac443399", "translation" => "مضمار سباق سيدي نايل هو مكان محمل بالتاريخ والعواطف. يقع في إطار خلاب عند سفح جبال الأطلس الصحراوي ويتمتع بموقع متميز في قلب المرتفعات الجزائرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //731
            ["id" => "32938683-8c99-4745-bca7-da70630047d1", "translation" => "The Si Belgacem Bellahreche mosque, also known as the Old Mosque, is one of the oldest religious buildings in the wilaya of El Djelfa. Built in 1879, it bears witness to the history and religious tradition of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0f026f1a-9c66-4d2b-8334-d254f2f9e2b5", "translation" => "La mosquée Si Belgacem Bellahreche, également connue sous le nom de Vieille Mosquée, est l'un des édifices religieux les plus anciens de la wilaya d’el Djelfa. Construite en 1879, elle témoigne de l'histoire et de la tradition religieuse de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0fb52de6-8359-429a-8b4a-89bb17acb6a0", "translation" => "مسجد سي بلقاسم بلحرش، المعروف أيضًا باسم المسجد القديم، هو واحد من أقدم المباني الدينية في ولاية الجلفة. تم بناؤه في عام 1879، وهو يشهد على تاريخ وتقاليد المنطقة الدينية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //732
            ["id" => "28cb7fd2-a108-416a-a830-b094f074e80e", "translation" => "The El Djelfa mujahid museum plays a crucial role in preserving national history and passing on the values of patriotism, courage, and determination to future generations. It serves as a living testament to the struggle for freedom and a place for reflection on the sacrifices made for Algeria's independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "114604cb-1d24-4d93-9883-2c25edccb24e", "translation" => "Le musée du Moudjahid d'el Djelfa joue un rôle essentiel dans la préservation de l'histoire nationale et dans la transmission des valeurs de patriotisme, de courage et de détermination aux générations futures. Il constitue un témoignage vivant de la lutte pour la liberté et un lieu de réflexion sur les sacrifices consentis pour l'indépendance de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ab23b57e-2780-4b7f-aac0-66bd672d69ab", "translation" => "متحف المجاهد في الجلفة يلعب دورًا أساسيًا في الحفاظ على التاريخ الوطني ونقل قيم الوطنية والشجاعة والعزم إلى الأجيال القادمة. إنه شاهد حي على النضال من أجل الحرية و مكان للتفكير في التضحيات التي تمت لاستقلال الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //733
            ["id" => "b3d9ae69-b654-4623-bbaf-6240bd2dd319", "translation" => "This geological site offers a unique and fascinating landscape, where salt formations create striking color contrasts. It is a major attraction for geology enthusiasts and visitors interested in natural wonders.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "55ce724f-081a-4f0a-b560-d75ec922184c", "translation" => "Ce site géologique offre un paysage unique et fascinant, où les formations de sel créent des contrastes de couleurs saisissants. Il constitue une attraction majeure pour les amateurs de géologie et les visiteurs intéressés par les merveilles naturelles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ffd7421a-02a1-4b78-af10-5c9f650c6013", "translation" => "هذا الموقع الجيولوجي يقدم منظرًا فريدًا وساحرًا، حيث تُشكل تكوينات الملح تباينات لونية بارزة. إنه عامل جذب أساسي لهواة علم الجيولوجيا والزوار الذين يهتمون بعجائب الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //734
            ["id" => "894cfa0b-4733-42ca-a134-6afecd233bd6", "translation" => "The Goutia forest is a true natural gem in the Djelfa province, offering visitors an enchanting setting where they can rejuvenate, have fun, and appreciate the beauty of nature. It is a place to preserve and respect, as it represents a valuable ecosystem and a relaxation space for the residents and tourists of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8059cf8d-8244-46a9-96b5-d6029b0fe84e", "translation" => "La forêt de Goutia représente un véritable joyau naturel dans la wilaya de Djelfa, offrant aux visiteurs un cadre enchanteur où ils peuvent se ressourcer, se divertir et apprécier la beauté de la nature. C'est un lieu à préserver et à respecter, car il constitue un écosystème précieux et un espace de détente pour les habitants et les touristes de la région..", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "77775a70-c871-494d-8300-703724eabc8e", "translation" => "غابة ڨطية تمثل جوهرة طبيعية حقيقية في ولاية الجلفة، حيث توفر للزوار بيئة ساحرة يمكنهم فيها التجديد والاستمتاع وتقدير جمال الطبيعة. إنها مكان يجب الحفاظ عليه واحترامه، حيث تمثل نظام بيئي قيمًا ومساحة للاسترخاء لسكان المنطقة والسياح على حد سواء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //735
            ["id" => "48d87d27-a50c-4aa4-b359-8604f9897996", "translation" => "The Hammam Charef thermal resort, dating back to the 19th century, is a place where visitors can enjoy relaxing baths, relieve their pains, and benefit from the therapeutic properties of these hot waters. It is a conducive place for relaxation and rejuvenation, where the natural benefits of thermal water provide a welcome respite, especially during periods of intense heat.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e1d462d9-c7f9-47e6-9296-c1aa16e4856b", "translation" => "La station thermale de Hammam Charef qui remonte au 19ème siècle, est un lieu où les visiteurs peuvent profiter de bains relaxants, soulager leurs douleurs et bénéficier des vertus thérapeutiques de ces eaux chaudes. C'est un endroit propice à la détente et à la régénération, où les bienfaits naturels de l'eau thermale offrent un répit bienvenu, en particulier pendant les périodes de chaleur intense.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "30860227-39f6-4d26-a755-1235f153fa17", "translation" => "منتجع حمام شارف, التي يعود تاريخها إلى القرن التاسع عشر، هي مكان يمكن للزوار فيه الاستمتاع بالحمامات المريحة، وتخفيف آلامهم، والاستفادة من الخصائص العلاجية لمياه الحمام الساخنة. إنه مكان مناسب للاسترخاء والتجديد، حيث توفر فوائد المياه الحرارية الطبيعية الراحة المرحب بها، خاصة خلال فترات الحر الشديد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //736
            ["id" => "94be2cdb-bcf9-45e8-b0a4-e36281be848a", "translation" => "Ksar el Hara is one of the ancient palaces built by the Turks during the Ottoman era. Therefore, this place is a historical site that deserves to be discovered and appreciated for its cultural and architectural value, although there is still much to uncover about its history and precise significance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "17ec3a86-821e-4825-97cc-eb9152f46d2f", "translation" => "Ksar el Hara fait partie des anciens palais érigés par les Turcs à l'époque ottomane. Ce lieu est donc un site historique qui mérite d'être découvert et apprécié pour sa valeur culturelle et architecturale, bien qu'il reste encore beaucoup à découvrir sur son histoire et son importance précise.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b39f87f3-7f12-40be-9191-195696f76675", "translation" => "قصر الحارة هو واحد من القصور القديمة التي بناها الأتراك خلال العصر العثماني. لذا، هذا المكان هو موقع تاريخي يستحق الاكتشاف والتقدير لقيمته الثقافية والمعمارية، على الرغم من أن هناك الكثير لاكتشافه بعد حول تاريخه وأهميته الدقيقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //737
            ["id" => "00cfcf4b-c969-4edf-8558-9f9cd2a8dd46", "translation" => "The Amoura waterfalls are a place of interest for nature lovers. They offer a unique experience where natural beauty blends with cultural heritage, creating a captivating environment for visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "98051ada-9d2b-4a6b-82de-3f83114dd72e", "translation" => "Les chutes d'Amoura sont un lieu d'intérêt pour les amoureux de la nature. Elles offrent une expérience unique où la beauté naturelle se mêle à l'héritage culturel, créant ainsi un environnement captivant pour les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "effdb9cb-7714-410e-82d3-c8388b15cdab", "translation" => "شلالات عمورة هي مكان يثير اهتمام عشاق الطبيعة. إنها تقدم تجربة فريدة حيث تمتزج الجمال الطبيعي بالتراث الثقافي، مما يخلق بيئة مثيرة للاستمتاع للزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //738
            ["id" => "8c7f8d10-8fdb-480d-824a-a1b385e3f91d", "translation" => "As a historically significant site, the Guelt es Stel torture center can serve as a place of remembrance, reminding of the atrocities committed and urging vigilance to prevent such violations in the future.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d10262d6-89a5-4ebc-a342-374b7a451d44", "translation" => "En tant que site chargé d'histoire, le centre de torture de Guelt es Stel peut servir de lieu de mémoire et de réflexion, rappelant les atrocités commises et invitant à la vigilance pour prévenir de telles violations à l'avenir.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "facd4721-212d-4316-92ff-cff1bea1fa8d", "translation" => "بوصفه موقعًا ذا تاريخ غني، يمكن لمركز التعذيب قلتة السطل أن يكون مكانًا للتذكير والتفكير، حيث يُذكّر بالجرائم البشعة التي ارتكبت ويحث على اليقظة لمنع مثل هذه الانتهاكات في المستقبل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //739
            ["id" => "7ecf13e7-c418-459b-b46b-daa015b559e9", "translation" => "Whether it's a family outing, a relaxing day, or celebrating special events, The Ain Oussera amusement park is a popular destination that ensures fun and entertainment for all its visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b1f441ce-f1d5-48fa-8916-37015f703d52", "translation" => "Que ce soit pour une sortie en famille, une journée de détente ou pour célébrer des événements spéciaux, le parc d'attractions d'Ain Oussera est un lieu prisé qui garantit amusement et divertissement pour tous ses visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d9473499-183d-46e4-98b2-8dd0c0e3cd3a", "translation" => "سواء كنت تخطط للخروج مع العائلة أو الاسترخاء في يوم هادئ أو للاحتفال بمناسبات خاصة، فإن حديقة التسلية عين وسارة هي وجهة مشهورة تضمن المرح والتسلية لجميع زوارها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //740
            ["id" => "73150b5c-82f0-4fea-85aa-540752c0016b", "translation" => "The El Hodna museum offers visitors a fascinating glimpse into the history and culture of the region through artifacts representing different archaeological periods and eras.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "138d7853-2965-4a1a-8fa0-8946d8766f16", "translation" => "Le musée d'el Hodna offre ainsi aux visiteurs un aperçu fascinant de l'histoire et de la culture de la région, à travers des artefacts représentatifs des différentes périodes et époques archéologiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3104dca6-63b9-4eaf-b917-939d29fd8663", "translation" => "يقدم متحف الحضنة للزوار نظرة مثيرة على تاريخ وثقافة المنطقة، من خلال القطع الأثرية التي تمثل فترات وحقب زمنية مختلفة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //741
            ["id" => "6f74add0-cfac-4d87-a289-77b9fd5bf287", "translation" => "The M'sila museum of the mujahid is a place dedicated to the memory and history of the Algerian war of independence. It houses a collection of objects, photographs, and documents related to this crucial period in Algeria's history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8bf10e8d-6771-4660-9a44-b3a97800c716", "translation" => "Le musée du Moudjahid à M'sila est un lieu dédié à la mémoire et à l'histoire de la guerre d'indépendance algérienne. Il présente une collection d'objets, de photographies et de documents relatifs à cette période cruciale de l'histoire de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "82f4dcad-64ff-41ed-85a7-332a89b5caa6", "translation" => "متحف المجاهد في مسيلة هو مكان مخصص لذكرى وتاريخ حرب الاستقلال الجزائرية. يحتوي على مجموعة من الأشياء والصور والوثائق المتعلقة بهذه الفترة الحاسمة في تاريخ الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //742
            ["id" => "6a3f62d7-1ddd-4629-a31d-63f16ad4fc96", "translation" => "This urban garden is a true refuge to escape the fast-paced urban life. It provides the residents of M'sila with a space for relaxation and unwinding.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "809230e9-f2df-409c-8d96-d51d947a3214", "translation" => "Ce jardin en ville est un véritable refuge pour échapper au rythme effréné de la vie urbaine. Il offre aux habitants de M'sila un espace de détente et de relaxation.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "89562154-ac0f-42e5-bafa-c49b129d6da2", "translation" => "هذه الحديقة في المدينة هي ملاذ حقيقي للهروب من حياة العصف الحضري السريعة. إنها توفر لسكان مسيلة مساحة للاسترخاء والاستجمام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //743
            ["id" => "5ebe0e12-06b6-495a-9eac-d581d7fdfa14", "translation" => "This zoo is a popular destination for families, students, and nature enthusiasts who want to spend an enjoyable day observing and learning about animals.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4a6f9d6e-cedf-4f9b-8d1a-f51604bab377", "translation" => "Ce parc zoologique est un lieu prisé par les familles, les étudiants et les amoureux de la nature qui souhaitent passer une journée agréable en observant et en apprenant sur les animaux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3ed5b0bf-eeef-4801-8b58-a2fc83480eab", "translation" => "هذه حديقة الحيوانات مكان مفضل للعائلات والطلاب وعشاق الطبيعة الذين يرغبون في قضاء يوم ممتع في مشاهدة وتعلم عن الحيوانات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //744
            ["id" => "1f5c1413-c9fc-49b7-8fa0-81a1b93abe89", "translation" => "Sabri Land is a dynamic and entertaining amusement park that provides moments of joy, excitement, and relaxation. Whether with family, friends, or in a group, this park is an ideal place to have fun and create memorable memories during a day of adventure in M'sila.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7e02fee8-756b-4c45-b78c-71cfcabaa23f", "translation" => "Sabri Land est un parc d'attractions dynamique et divertissant qui offre des moments de joie, d'excitation et de détente. Que ce soit en famille, entre amis ou en groupe, ce parc est un lieu idéal pour s'amuser et créer des souvenirs mémorables lors d'une journée d'aventure à M'sila.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "113fa08c-c0dd-4bd2-84ce-a7302f71628b", "translation" => "صبري لاند هو متنزه ترفيهي ديناميكي ومسلي يقدم لحظات من الفرح والإثارة والاسترخاء. سواء كنت مع العائلة، أو الأصدقاء، أو في مجموعة، هذا المتنزه هو مكان مثالي للاستمتاع وخلق ذكريات لا تُنسى خلال يوم مليء بالمغامرات في مسيلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //745
            ["id" => "815c622a-a11b-45c0-935f-19c23fc25e7f", "translation" => "The Kalaa of Beni Hammad is more than just a historical site. It is a place rich in history, beauty, and cultural significance. It reminds visitors of the grandeur of a once prosperous kingdom and inspires a sense of reverence for the resilience of these structures that have stood the test of time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4ae8cac2-891b-4074-92bf-2a54752f833b", "translation" => "La kalaa des Beni Hammad est bien plus qu'un simple site historique. C'est un lieu chargé d'histoire, de beauté et de signification culturelle. Elle rappelle aux visiteurs la grandeur d'un royaume autrefois prospère et inspire un sentiment de respect face à la résilience de ces structures qui ont résisté à l'épreuve du temps.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "519d399f-60b7-42ac-ae3b-344407a34440", "translation" => "قلعة بني حماد هي أكثر من مجرد موقع تاريخي. إنها مكان غني بالتاريخ والجمال والأهمية الثقافية. إنها تذكر الزوار بعظمة مملكة كانت مزدهرة في الماضي وتلهم شعورًا بالاحترام تجاه صمود هذه الهياكل التي تحملت مرور الزمن.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //746
            ["id" => "8ba9edcc-e67b-414b-ab08-c992303e3251", "translation" => "The Maadid museum is a must-visit for history and culture enthusiasts. With its strategic location near the Kalâa of Beni Hammad citadel and its collection of remarkable archaeological artifacts, it provides an enriching and captivating experience for all visitors seeking knowledge about the region's history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3e8c77b4-df3e-43bf-8da5-89629bc9115a", "translation" => "Le musée de Maadid est un lieu incontournable pour les amateurs d'histoire et de culture. Avec son emplacement stratégique à proximité de la citadelle Kalâa des Béni Hammad et sa collection d'objets archéologiques remarquables, il offre une expérience enrichissante et captivante pour tous les visiteurs en quête de connaissances sur le passé de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "22a2f85f-f697-4a90-a3db-e729d64e147c", "translation" => "متحف المعاضيد هو مكان لا غنى عنه لعشاق التاريخ والثقافة. بفضل موقعه الاستراتيجي القريب من قلعة بني حماد ومجموعته الرائعة من القطع الأثرية، يقدم تجربة غنية ومثيرة لجميع الزوار الذين يبحثون عن المعرفة حول تاريخ المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //747
            ["id" => "6f689b57-fe16-4df7-aa3b-c3908b2ae131", "translation" => "The Abou el Fadl Nahoui mosque is a sacred place that honors and represents the cultural and spiritual heritage of the region. Besides being a place of worship, the mosque is a symbol of wisdom and inspiration, where visitors can feel a connection to the past and find comfort and serenity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "042ace41-cb96-4081-a648-74120877e495", "translation" => "La mosquée Abou el Fadl Nahoui est un lieu sacré qui honore et représente l'héritage culturel et spirituel de la région. En plus d'être un lieu de prière, la mosquée est un symbole de sagesse et d'inspiration, où les visiteurs peuvent ressentir une connexion avec le passé et trouver réconfort et sérénité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0556d63e-088c-4fe6-b587-725092a81b66", "translation" => "مسجد ابو الفضل النحوي هو مكان مقدس يكرم ويمثل التراث الثقافي والروحي للمنطقة. بالإضافة إلى كونه مكانًا للصلاة، يعتبر الجامع رمزًا للحكمة والإلهام، حيث يمكن للزوار أن يشعروا باتصالٍ بالماضي وأن يجدوا الراحة والسكينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //748
            ["id" => "73398229-1a9f-41bb-9bbb-635f1a3fb74a", "translation" => "The El Ksob dam is a place for relaxation, leisure, and connection with nature. Whether it's to observe the fishermen or to enjoy the tranquility of the location for rejuvenation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4af8b630-d77f-45d1-ac0f-b09a91d72e55", "translation" => "Le barrage el Ksob est un lieu de détente, de loisirs et de contact avec la nature. Que ce soit pour observer les pêcheurs ou pour profiter de la tranquillité du lieu pour se ressourcer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7aa52935-19ea-44b1-99ae-29f99b08fa25", "translation" => "سد القصب هو مكان للاسترخاء والترفيه والتواصل مع الطبيعة. سواء لمراقبة الصيادين أو للاستمتاع بسكون المكان للتجديد والاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //749
            ["id" => "eb9ae6b7-1b67-4229-8dec-70560bbc8a86", "translation" => "It is an archaeological site and a historic monument that narrates and bears witness to the history and civilizations that have succeeded in the region, as well as the people who have lived and settled there, leaving behind numerous remnants and testimonies.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1e702820-9bd4-494d-8a2e-0c05bbd6c4c0", "translation" => "C'est un site archéologique et un monument historique qui raconte et témoigne de l'histoire et des civilisations qui se sont succédé dans la région, ainsi que des personnes qui y ont vécu et s'y sont installées, laissant derrière elles de nombreux vestiges et témoignages.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a3237c96-d4ed-4524-b869-9b4b872c0a78", "translation" => "إنه موقع أثري ونصب تاريخي يحكي ويشهد على التاريخ والحضارات التي تعاقبت في المنطقة، وكذلك على الأشخاص الذين عاشوا واستقروا فيها، تاركين وراءهم العديد من الآثار والشهادات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //750
            ["id" => "cacbe96f-2613-4358-ae7d-39380a094cf9", "translation" => "The works displayed in the museum allow us to appreciate Dinet's artistic mastery, as well as his interest in representing everyday life, landscapes, and traditional scenes of Algeria. It is a must-visit place for art enthusiasts and fans of the artist's work, offering insight into his talent and commitment to preserving and celebrating local culture.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cb2b6912-96f5-4b69-b105-36bf47a67a32", "translation" => "Les œuvres exposées au musée permettent d'apprécier la maîtrise artistique de Dinet, ainsi que son intérêt pour la représentation de la vie quotidienne, les paysages et les scènes traditionnelles de l'Algérie. C'est un lieu incontournable pour les amateurs d'art et les passionnés de l'œuvre de l’artiste, offrant un aperçu de son talent et de son engagement envers la préservation et la célébration de la culture locale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2767fe04-0e1c-4a50-ae91-56987bc7d01f", "translation" => "الأعمال المعروضة في المتحف تسمح لنا بتقدير الإتقان الفني لنصر الدين ديني، بالإضافة إلى اهتمامه بتصوير الحياة اليومية والمناظر الطبيعية والمشاهد التقليدية للجزائر. إنه مكان لا غنى عنه لعشاق الفن ومحبي أعمال الفنان، حيث يقدم نظرة على موهبته والتزامه تجاه الحفاظ على والاحتفال بالثقافة المحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //751
            ["id" => "134f6422-ccb8-4f1e-9552-550e4f47d7b8", "translation" => "The fort Cavaignac is a symbol of Bou Saada's colonial past. It invites visitors to delve into history and explore the military architecture of the time while offering stunning views of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "10cecdc1-90d0-4fdd-86a3-06de3293a0fb", "translation" => "Le fort Cavaignac est un symbole du passé colonial de Bou Saada. Il invite les visiteurs à plonger dans l'histoire et à découvrir l'architecture militaire de l'époque, tout en offrant une vue imprenable sur la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "243752d5-2914-407d-8e5b-2bf67179915f", "translation" => "قلعة كافينياك هي رمز للماضي الاستعماري لبوسعادة. إنها تدعو الزوار للانغماس في التاريخ واستكشاف الهندسة المعمارية العسكرية لتلك الحقبة، مع توفير إطلالة رائعة على المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //752
            ["id" => "2b9d0f5a-99c8-43e9-befe-b15cf419ebbd", "translation" => "Whether it's for buying souvenir gifts, decorative items, or simply to explore local craftsmanship, the craft market of Bou Saada is the ideal place. It provides visitors with an immersion into the culture and artisanal heritage of the region, allowing them to take home a piece of the region's soul.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0d14f0b8-bd7c-45cd-8e9e-cf030fbd0602", "translation" => "Que ce soit pour acheter des cadeaux souvenirs, des objets de décoration ou simplement pour découvrir l'artisanat local, le marché de l'artisanat de Bou Saada est l'endroit idéal. Il offre aux visiteurs une immersion dans la culture et le patrimoine artisanal de la région, permettant ainsi de rapporter chez soi un peu de l'âme de cette région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8d1895db-a85c-40b6-bdad-1991d7f7c16d", "translation" => "سواء كان الأمر يتعلق بشراء هدايا تذكارية أو ببساطة لاكتشاف الصناعات اليدوية المحلية، سوق الحرف في بوسعادة هو المكان المثالي. إنه يوفر للزوار تجربة غمر في الثقافة والتراث الحرفي للمنطقة، مما يسمح لهم بأخذ جزء من روح هذه المنطقة معهم إلى منازلهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //753
            ["id" => "e9fbf0a2-3077-4fd4-9879-5489e1883a57", "translation" => "The Ferrero Mill is a place steeped in history, housing the remains of an old mill built by the Italian Antoine Ferrero near a waterfall. After settling in Algeria in 1867, Ferrero chose this location to harness the water's driving force and establish his mill. This picturesque site has also been used as a filming location for several movies, including 'Samson and Delilah'.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "969a4e60-52fb-464d-b733-2e6059a8d54e", "translation" => "Le moulin Ferrero est un lieu chargé d'histoire, abritant les vestiges d'un ancien moulin construit par l'italien Antoine Ferrero près d'une cascade. Après s'être installé en Algérie en 1867, Ferrero a choisi cet emplacement pour profiter de la force motrice de l'eau et mettre en place son moulin. Ce site pittoresque a également été utilisé comme lieu de tournage de plusieurs films, dont 'Samson et Dalila'.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "abd806f7-501c-4429-8511-8a8bd93d46b3", "translation" => "مطحنة فيريرو هي مكان ذو تاريخ طويل، تحتضن بقايا مطحنة قديمة تم بناؤها من قبل الإيطالي أنطوان فيريرو بالقرب من شلال. بعد استقراره في الجزائر في عام 1867، اختار فيريرو هذا الموقع للاستفادة من القوة الحركية للمياه وإنشاء مطحنته. كموقع جميل، تم استخدام هذا المكان أيضًا كموقع تصوير لعدة أفلام، بما في ذلك 'شمشون ودليلة'.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //754
            ["id" => "ed3dc4eb-df18-471e-b616-4323a5b10e05", "translation" => "Visitors can enjoy this space to relax, read a book, or simply admire the beauty of nature in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "243aaa9b-ac53-42dc-9c43-dd071fee38b5", "translation" => "Les visiteurs peuvent profiter de cet espace pour se reposer, lire un livre ou simplement admirer la beauté de la nature en plein cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5598a6e5-773a-4224-8be9-1991d003d669", "translation" => "يمكن للزوار الاستمتاع بهذا المكان للاستراحة، قراءة كتاب أو مجرد التمتع بجمال الطبيعة في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //755
            ["id" => "07b7705e-7a00-4da0-afaf-74df81822c51", "translation" => "The Kamra waterfalls is a true natural paradise, where visitors can get lost in the splendor of waterfalls and enjoy breathtaking panoramic views. It's a must-visit place in the region, offering a unique and memorable experience in the heart of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ce756082-9f73-4549-845b-98b715d71d43", "translation" => "Les chutes de Kamra sont un véritable paradis naturel, où les visiteurs peuvent se perdre dans la splendeur des cascades et profiter de vues panoramiques à couper le souffle. C'est un lieu à ne pas manquer lors de votre visite dans la région, offrant une expérience unique et mémorable en pleine nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9f4b6ef3-a093-4902-bf4d-95451efde8f4", "translation" => "شلالات قمرة هي فعلاً جنة طبيعية، حيث يمكن للزوار أن يتوهوا في روعة الشلالات ويستمتعوا بمناظر بانورامية رائعة تأسر الألباب. إنه مكان يجب زيارته في المنطقة، حيث يقدم تجربة فريدة ولا تُنسى في قلب الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //756
            ["id" => "509433b9-f14c-452a-a9d8-3d0fbf543843", "translation" => "The Mrigha amusement park offers a wide range of attractions and entertainment for all tastes. Whether you're looking for thrill rides, fun water games, or simply a pleasant place to relax, this park will meet your expectations and provide you with an entertaining and memorable experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c5a37d89-57a1-40f7-9957-3625d85151a1", "translation" => "Le parc d'attractions Mrigha offre une large gamme d'attractions et de divertissements pour tous les goûts. Que vous soyez à la recherche de sensations fortes, de jeux d'eau amusants ou simplement d'un endroit agréable pour vous détendre, ce parc saura répondre à vos attentes et vous offrir une expérience divertissante et mémorable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "14ae9efe-66b9-4f1d-bd7d-1307b1de1b85", "translation" => "حديقة التسلية المريغة يقدم مجموعة واسعة من الألعاب والترفيه لجميع الأذواق. سواء كنت تبحث عن ركوب الألعاب المثيرة، أو ألعاب الماء الممتعة، أو ببساطة مكانًا لطيفًا للاسترخاء، سيتمكن هذا المنتزه من تلبية توقعاتك وتقديم تجربة مسلية ولا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //757
            ["id" => "048d9fad-80b8-46c0-b62f-e0d5e4734e98", "translation" => "The museum of the mujahid in Laghouat is a place of remembrance and celebration of the heritage of the independence fighters. Through its exhibitions and collections, it allows visitors to delve into the history of Algeria and pay tribute to those who fought for the freedom and dignity of their country.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "266d0805-b2b9-40c8-aa7d-31e5bda21706", "translation" => "Le musée du Moudjahid de Laghouat est un lieu de commémoration et de valorisation de l'héritage des combattants de la guerre d'indépendance. À travers ses expositions et ses collections, il permet aux visiteurs de plonger dans l'histoire de l'Algérie et de rendre hommage à ceux qui ont lutté pour la liberté et la dignité de leur pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1b85229d-3af2-462f-a84d-578f672e82fb", "translation" => "متحف المجاهد في الأغواط هو مكان للاحتفال بالتراث الذي خلفه مقاتلو الاستقلال. من خلال معارضه ومجموعاته، يتيح للزوار الانغماس في تاريخ الجزائر وتقديم الاحترام لأولئك الذين قاتلوا من أجل حرية وكرامة بلدهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //758
            ["id" => "ea076df9-9ff9-4847-8554-fce3b04b5cf2", "translation" => "The M'zi cinema is a dynamic place that combines the cinematic experience with live performances, including concerts and other artistic events. It's a versatile space where you can enjoy both film screenings and live performances.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4b643e9a-9994-4331-b928-957fe6ea0370", "translation" => "Le Cinéma M’zi est un lieu dynamique qui allie l'expérience cinématographique à des spectacles en direct, y compris des concerts et d'autres événements artistiques. C'est un espace polyvalent où vous pouvez apprécier à la fois des projections de films et des représentations en direct.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0472fa8a-34e8-46e7-a1b8-c9d3dd0e6c5d", "translation" => "سينما مزي مكان دينامي يجمع بين تجربة السينما والعروض الحية، بما في ذلك الحفلات الموسيقية والفعاليات الفنية الأخرى. إنها مساحة متعددة الاستخدام حيث يمكنك الاستمتاع بعروض أفلام وعروض حية على حد سواء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //759
            ["id" => "060d858c-8a45-4a78-842b-ae8010fbc841", "translation" => "The priceless treasures of the museum include prehistoric archaeological pieces dating back 7,000 years, including rock engravings and ruined Berber villages. These relics bear witness to the rich historical past of Laghouat and highlight its often overlooked tourist potential.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "af94683c-a5aa-493e-9b2e-7a80bee03d47", "translation" => "Les trésors inestimables du musée incluent des pièces archéologiques préhistoriques datant de 7 000 ans, notamment des gravures rupestres et des villages berbères en ruines. Ces vestiges témoignent du riche passé historique de Laghouat et mettent en valeur ses potentialités touristiques souvent méconnues du grand public.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7db160cf-4bfe-46d5-ab06-bb7678bf423f", "translation" => "الكنوز اللا تقدير لها في المتحف تشمل قطعًا أثرية ما قبل التاريخ تعود إلى 7000 سنة، بما في ذلك النقوش على الصخور والقرى الأمازيغية المتهالكة. هذه الآثار تشهد على الماضي التاريخي الغني لمدينة الأغواط وتسلط الضوء على إمكانياتها السياحية التي غالباً ما تكون مجهولة للجمهور العام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //760
            ["id" => "7e36b5f4-023f-4c65-b82b-942e25d23acc", "translation" => "The fort Morand is a symbol of Laghouat's colonial history and a testament to the military architecture of that era. It is a place of interest for visitors who are interested in the region's history and wish to explore its heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ef242619-51f9-450f-8e9a-848ff012fedf", "translation" => "Le fort Morand est un symbole de l'histoire coloniale de Laghouat et un témoignage de l'architecture militaire de l'époque. Il est un lieu d'intérêt pour les visiteurs qui s'intéressent à l'histoire de la région et qui souhaitent découvrir son patrimoine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5d193fd9-d692-4d72-9865-bb268afd4799", "translation" => "قلعة موراند هي رمز لتاريخ الأغواط الاستعماري وشاهد على العمارة العسكرية في تلك الفترة. إنها مكان مثير للاهتمام للزوار الذين يهتمون بتاريخ المنطقة ويرغبون في استكشاف تراثها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //761
            ["id" => "bc714661-9cb8-467d-930c-b715b2be7238", "translation" => "The fort Bouscaren bears witness to the military history of Laghouat and represents significant architectural heritage. It serves as a real window to the past, recalling events related to the French colonization of the region. Today, it is a place to visit and explore for history enthusiasts and those curious about the region's history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ca31ad55-11cf-42cc-8c05-1dc619641df8", "translation" => "Le fort Bouscaren témoigne de l'histoire militaire de Laghouat et constitue un patrimoine architectural important. Il est une véritable fenêtre sur le passé et rappelle les événements liés à la colonisation française de la région. Aujourd'hui, il est un lieu de visite et de découverte pour les passionnés d'histoire et les curieux qui souhaitent explorer l'histoire de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "247f9b2e-d9e4-4279-9f43-82a6acb8b50f", "translation" => "حصن بوسكارين تشهد على التاريخ العسكري للأغواط وتمثل تراثاً معمارياً هاماً. إنها نافذة حقيقية إلى الماضي، تستحضر الأحداث المتعلقة باحتلال المنطقة من قبل الفرنسيين. اليوم، هي مكان لزيارة واستكشاف لعشاق التاريخ والفضوليين الذين يرغبون في استكشاف تاريخ المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //762
            ["id" => "8ca1cd80-7e25-4306-8837-badc9d66b687", "translation" => "Built in 1876 by the Italian architect Molenari, the El Safah mosque stands out with its unique architectural style. Its name refers to the large rock on which it is built, giving this religious building a distinctive character.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "eb4f7cca-55b3-41f9-9214-33f11d27e172", "translation" => "Construite en 1876 par l'architecte italien Molenari, la mosquée el Safah se distingue par son style architectural unique. Son nom fait référence au grand rocher sur lequel elle est érigée, donnant ainsi un caractère distinctif à cet édifice religieux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cf1a269b-ee02-4071-883d-17489fe9342e", "translation" => "بُني مسجد الصفاح في عام 1876 على يد المهندس المعماري الإيطالي موليناري، ويتميز بأسلوبه المعماري الفريد. يأخذ اسمه من الصخرة الكبيرة التي تم بناؤه عليها، مما يمنح هذا المبنى الديني طابعًا مميزًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //763
            ["id" => "87ebc602-93d3-4193-babb-e0b0cf8ca0e7", "translation" => "The regional theater of Laghouat is a dynamic venue that promises to enrich the cultural scene of the region by offering the people of Laghouat enriching and inspiring artistic experiences.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7bc01ce5-01c5-4df4-9f66-1c423ac74f65", "translation" => "Le théâtre régional de Laghouat est un lieu dynamique qui promet d'enrichir la scène culturelle de la région en proposant aux habitants de Laghouat des expériences artistiques enrichissantes et inspirantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "571fddea-0f5f-4423-a500-1937372ba773", "translation" => "المسرح الجهوي للأغواط هو مكان دينامي يعد بإثراء الساحة الثقافية في المنطقة من خلال تقديم تجارب فنية مثرية وملهمة لأهل المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //764
            ["id" => "9ce068f0-46fe-4f7a-93f6-51fe9f80029b", "translation" => "Kef el Melh is a remarkable natural site consisting of a valley that leads to a salt cave. This place has a unique charm due to the variation of colors in the rocks, which are covered with a white salty substance that blends harmoniously with the natural hues of the surrounding rocks.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "73ac6204-7118-4b30-a382-bb6c3c325625", "translation" => "Kef el melh est un site naturel remarquable composé d'une vallée qui mène à une grotte de sel. Cet endroit dégage un charme particulier en raison de la variation des couleurs dans les roches, qui sont recouvertes d'une substance salée blanche qui se mélange harmonieusement aux teintes naturelles des roches environnantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bd7d5d33-f109-46ce-8187-964ee4f00b12", "translation" => "كاف الملح هو موقع طبيعي رائع يتكون من وادٍ يؤدي إلى كهف ملحي. يتميز هذا المكان بسحر فريد نتيجة التنوع في الألوان في الصخور، حيث تكون مغطاة بمادة ملحية بيضاء تمتزج بانسجام مع ألوان الصخور المحيطة الطبيعية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //765
            ["id" => "8c0bc103-ae54-4415-8904-fa98c24e5484", "translation" => "The el Maïa dam offers a dual purpose, both for the preservation of aquatic life and the conservation of migratory birds. It is a place where nature unfolds in all its splendor, allowing visitors to admire local biodiversity and enjoy the serenity of this aquatic environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b2764df8-3f74-45f0-ad7c-3d928d16cd9d", "translation" => "Le barrage d'el Maïa offre un double intérêt, tant pour la préservation de la vie aquatique que pour la conservation des oiseaux migrateurs. C'est un endroit où la nature se déploie dans toute sa splendeur, offrant aux visiteurs la possibilité d'admirer la biodiversité locale et de profiter de la sérénité de cet environnement aquatique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c73b30bb-3a38-4244-bcde-9d918f16dad6", "translation" => "سد الماية يقدم فائدة مزدوجة، سواء للحفاظ على الحياة المائية أو للمحافظة على الطيور المهاجرة. إنه مكان حيث تتجلى الطبيعة بكل بهائها، مما يتيح للزوار مشاهدة التنوع البيولوجي المحلي والاستمتاع بسكينة هذه البيئة المائية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //766
            ["id" => "58618477-dd4f-4471-9141-c3d28aba9ba0", "translation" => "Ksar Ain Madi is a true architectural treasure, where art and history come together to offer an unforgettable experience to visitors. It is a place steeped in traditions and legends, captivating visitors who come to discover its splendor and exceptional cultural heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ef5269f2-f4bd-41b8-8349-4fff27aa9826", "translation" => "Ksar Ain Madi est un véritable trésor architectural, où l'art et l'histoire se mêlent pour offrir une expérience inoubliable aux visiteurs. C'est un lieu chargé de traditions et de légendes, qui captive les visiteurs venus découvrir sa splendeur et son héritage culturel exceptionnel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ee744a5d-8d56-4fc4-bdff-09baca90d56c", "translation" => "قصر عين ماضي هو كنز معماري حقيقي، حيث يتداخل الفن والتاريخ لتقديم تجربة لا تُنسى للزوار. إنه مكان غني بالتقاليد والأساطير، والذي يأسر الزوار الذين يأتون لاكتشاف روعته وتراثه الثقافي الاستثنائي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //767
            ["id" => "8bb755e9-a0a7-4c7f-a349-f6348e6f74b4", "translation" => "Ksar Kourdane is much more than just a tourist site. It's a symbol of cultural unity and the beauty of diversity, providing an immersive and enriching experience for all who visit.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "80d96262-c57f-433c-b424-5140aed3a4a4", "translation" => "Ksar Kourdane est bien plus qu'un simple lieu touristique. C'est un symbole de l'union des cultures et de la beauté de la diversité, offrant une expérience immersive et enrichissante pour tous ceux qui le visitent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "722f0ff2-59d8-4b1f-a7b5-c2f319593daa", "translation" => "قصر كوردان هو أكثر من مجرد موقع سياحي. إنه رمز للوحدة الثقافية وجمال التنوع، ويقدم تجربة غامرة ومثرية لجميع الذين يزورونه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //768
            ["id" => "269cb08d-2e72-46c0-8fa0-8e8f6b108a4d", "translation" => "Due to its unique geological history and meteoritic nature, the Madna crater holds scientific significance and is a site of interest for researchers and geologists. It also serves as a geographical curiosity for visitors and geology enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2efdfd22-9ac6-4381-a903-53f009d94b73", "translation" => "En raison de son histoire géologique unique et de sa nature météoritique, le cratère de Madna revêt une importance scientifique et est un site d'intérêt pour les chercheurs et les géologues. Il constitue également une curiosité géographique pour les visiteurs et les amateurs de géologie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "998d3abe-4f9c-4eda-a5e3-3776721a3921", "translation" => "بسبب تاريخه الجيولوجي الفريد وطبيعته النيزكية، تحمل الفوهة النيزكية مادنة أهمية علمية ويعتبر موقعًا مثيرًا لاهتمام الباحثين وعلماء الجيولوجيا. كما أنه يشكل أيضًا فضولًا جغرافيًا للزوار وهواة علم الجيولوجيا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //769
            ["id" => "f933e5a6-6075-4e12-afa4-72388ea87731", "translation" => "The Aflou amusement park is a popular entertainment destination for local residents as well as tourists. It provides a fun and entertaining getaway, perfect for spending time with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e3099ce3-7223-42a6-aa88-c7ab4b41a77e", "translation" => "Le parc d'attractions d'Aflou est un lieu de divertissement prisé par les habitants locaux ainsi que par les touristes. Il offre une escapade amusante et divertissante, idéale pour passer du temps en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "93a4c30e-d0eb-4613-8eae-b69d4919b83e", "translation" => "حديقة التسلية و الترفيه بأفلو وجهة ترفيهية مشهورة بين سكان المنطقة المحليين وبين السياح أيضًا. يقدم هذا المكان فرصة ممتعة ومسلية، مثالية لقضاء وقت ممتع مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //770
            ["id" => "2fbb54a4-df85-4b60-9e45-4cf4cda15c09", "translation" => "This garden is a haven of peace in the heart of the city. A place where residents and visitors can escape the urban hustle and bustle, enjoy nature, and recharge in a green and welcoming environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f55fd46f-8585-42fa-a81e-b62f2f96951f", "translation" => "Ce jardin est un havre de paix au cœur de la ville. Un endroit où les habitants et les visiteurs peuvent échapper à l'agitation urbaine, profiter de la nature et se ressourcer dans un cadre verdoyant et accueillant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "215df4f2-5151-4c2b-9d4b-94b8ff449bf5", "translation" => "هذه الحديقة هي ملاذ للسلام في قلب المدينة. مكان حيث يمكن للسكان والزوار الهروب من صخب الحياة الحضرية، والاستمتاع بالطبيعة، والاستعادة في بيئة خضراء ومرحبة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //771
            ["id" => "c9645357-f77f-4f1f-a2cd-2a7412052479", "translation" => "The old ksar of Taouiala is a historical archaeological site that represents a major tourist attraction for the region. Unfortunately, it is threatened with extinction due to various natural and human factors that have led to the loss of several of its components.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c2238083-c8c6-481e-a8f1-3bbf84b4c9fa", "translation" => "Le vieux ksar de Taouiala est un site archéologique historique qui représente un atout touristique majeur pour la région. Malheureusement, il est menacé de disparition en raison de divers facteurs naturels et humains qui ont entraîné la perte de plusieurs de ses composantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5214bfa5-e93d-4d76-be38-2786faa5577a", "translation" => "قصر تاويالة موقع أثري تاريخي يُمثل إضافة سياحية رئيسية للمنطقة. للأسف، فإنها تتعرض لخطر الاندثار بسبب مجموعة من العوامل الطبيعية والبشرية التي أدت إلى فقدان العديد من مكوناتها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //772
            ["id" => "69bc852b-06e3-4c2e-a851-2a9abc247675", "translation" => "The rock engravings of el Ghicha are a valuable testament to the cultural and historical heritage of the region. They are a unique tourist attraction that allows visitors to delve into the past and appreciate the ancient art and history of this part of the world.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3d83289e-785e-4b9d-a7c6-414cba1ae227", "translation" => "Les gravures rupestres d'el Ghicha sont un témoignage précieux du patrimoine culturel et historique de la région. Elles sont une attraction touristique unique qui permet aux visiteurs de plonger dans le passé et d'apprécier l'art et l'histoire anciens de cette partie du monde.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fb712d79-2455-47b2-8ec4-cf731393cabe", "translation" => "نقوش صخرية الغيشة هي شهادة قيمة على التراث الثقافي والتاريخي للمنطقة. إنها جاذبية سياحية فريدة تتيح للزوار الانغماس في الماضي وتقدير الفن والتاريخ القديم لهذا الجزء من العالم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //773
            ["id" => "09d9f055-eb16-41e1-a95b-17c656f0ff25", "translation" => "The el Ghicha waterfalls are a natural treasure to discover and an unforgettable experience for nature lovers and travelers seeking enchanting landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "58031f15-d8a0-4b2b-84ba-4ad18c015335", "translation" => "Les chutes d'el Ghicha représentent un trésor naturel à découvrir et une expérience inoubliable pour les amoureux de la nature et les voyageurs en quête de paysages enchanteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e3801cd5-3431-4bd6-8b0c-26ac6e1db1ce", "translation" => "شلالات الغيشة تمثل كنزًا طبيعيًا يجب اكتشافه وتجربته لعشاق الطبيعة والمسافرين الذين يبحثون عن مناظر خلابة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //774
            ["id" => "efcd9b02-032b-4f1b-a6c0-5cda18f7b6af", "translation" => "This garden is a haven of peace in the heart of the city. It's a place where people can escape the urban hustle and bustle, connect with nature, and enjoy a moment of peace and relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2d3dccaa-8718-48b8-a8a7-c0ae9e6899d6", "translation" => "Ce jardin est un havre de paix au cœur de la ville. C'est un endroit où les gens peuvent échapper à l'agitation urbaine, se connecter avec la nature et profiter d'un moment de calme et de détente.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8bb30bfe-505a-4b6d-8432-fe2b56a57403", "translation" => "هذه الحديقة ملاذ سلام في قلب المدينة. إنها مكان يمكن للناس فيه الهروب من صخب وزحام المدينة، والتواصل مع الطبيعة، والاستمتاع بلحظة من السكينة والاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //775
            ["id" => "c96e9f04-bcca-4f67-8163-aa237e7cdd56", "translation" => "The square with children's attractions in Saïda is a social gathering place where local families and visitors can come together and interact. It's a place where children can create happy memories and experience moments of joy and excitement.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d0175f16-5bf2-49fd-845c-6d4f31a813c9", "translation" => "La place avec des attractions pour enfants à Saïda est un lieu de rassemblement social où les familles du quartier et les visiteurs peuvent se rencontrer et interagir. C'est un endroit où les enfants peuvent créer des souvenirs heureux et vivre des moments de joie et d'excitation.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "db620ef6-d603-43e2-827b-e6bdeef9f3fd", "translation" => "الساحة مكان للتجمع حيث يمكن للعائلات المحلية والزوار التقابل والتفاعل. إنها مكان يمكن للأطفال من خلاله خلق ذكريات سعيدة وتجربة لحظات من الفرح والاثارة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //776
            ["id" => "fd1aa779-43e7-4ab8-a407-b124a852b235", "translation" => "The amusement park in Saida is a must-visit entertainment destination for both locals and visitors to the region. It provides an opportunity to create lasting memories, share moments of joy with family, and enjoy a playful and lively environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ad7e2869-cd1c-4ae1-bd8b-cb1120e02db7", "translation" => "Le parc d'attractions de Saïda est un lieu de divertissement incontournable pour les habitants et les visiteurs de la région. Il offre une occasion de créer des souvenirs durables, de partager des moments de joie en famille et de profiter d'un environnement ludique et animé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e1e119cc-15bc-46df-82e9-7fa88bd134e2", "translation" => "حديقة التسلية في سعيدة هي وجهة ترفيهية لا غنى عن زيارتها للسكان المحليين والزوار إلى المنطقة على حد سواء. إنها توفر فرصة لخلق ذكريات دائمة، ومشاركة لحظات الفرح مع العائلة، والاستمتاع ببيئة مرحة وحيوية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //777
            ["id" => "c0317e37-2a6a-4f86-a7e6-88b94314b5be", "translation" => "The museum of the mujahid in Saida is an important place for preserving the history of the national liberation war. It allows visitors to delve into the past and gain a better understanding of the sacrifices made by the mujahideen for the country's independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e9f31bdd-c54b-4ae6-97a1-1bc07819066c", "translation" => "Le musée du Moudjahid de Saïda est un lieu important pour la préservation de l'histoire de la guerre de libération nationale. Il permet aux visiteurs de se plonger dans le passé et de mieux appréhender les sacrifices consentis par les moudjahidin pour l'indépendance du pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c9a2d6c6-98c3-4d5d-b9f7-54e6e38f240d", "translation" => "متحف المجاهد في سعيدة هو مكان هام للحفاظ على تاريخ حرب التحرير الوطني. يتيح للزوار الغوص في الماضي وفهم أفضل للتضحيات التي قدمها المجاهدين من أجل استقلال البلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //778
            ["id" => "e17caa22-f53b-4e9c-9d50-9602100b2f0a", "translation" => "The regional theater of Saida is an iconic cultural venue in the city. It is a space dedicated to promoting the performing arts, including theater, dance, music, and other forms of live entertainment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "efd3b013-37d5-4ea9-b78a-e3b1b1bbba2e", "translation" => "Le théâtre régional de Saïda est un lieu culturel emblématique de la ville. C'est un espace dédié à la promotion des arts de la scène, notamment le théâtre, la danse, la musique et d'autres formes de spectacles vivants.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f40388ec-d1f0-4b9d-8b96-f04ce3f484a0", "translation" => "المسرح الجهوي لولاية سعيدة هو مكان ثقافي رمزي في المدينة. إنه مكان مخصص لتعزيز فنون الأداء، بما في ذلك المسرح والرقص والموسيقى، وأشكال أخرى من أشكال الترفيه الحي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //779
            ["id" => "cb6e89cd-f4c1-4b75-8146-c1b09e473825", "translation" => "Despite the lack of regular screenings, the cinema in Saida remains a place that embodies the essence of cinema and cinematic culture. It symbolizes the community's desire to preserve this art and promote an enriching cinematic experience for the people of Saida.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2bada1e0-4739-4998-9eb7-76b1373f8ea8", "translation" => "Malgré le manque de projections régulières, le cinéma de Saida reste un lieu qui incarne l'essence du cinéma et de la culture cinématographique. Il symbolise le désir de la communauté de préserver cet art et de promouvoir une expérience cinématographique enrichissante pour les habitants de Saïda.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "93294ab4-4aae-4bbd-8da3-8757f8a5b434", "translation" => "على الرغم من عدم وجود عروض سينمائية منتظمة، يبقى سينما سعيدة مكانًا يجسد جوهر السينما وثقافة السينما. إنه يرمز إلى رغبة المجتمع في الحفاظ على هذا الفن وتعزيز تجربة سينمائية غنية لأهل سعيدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //780
            ["id" => "4c6698cc-ba1a-4f1e-abb2-2392645ae556", "translation" => "The gates of Mascara and Tiaret are two historical sites located in the center of the city of Saida, near the historical complex known as the redoubt district. They were built during the construction of the military citadel between 1854 and 1857 by two European architectural engineers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a6f70fd5-af52-4ed5-82a4-f253256d85ba", "translation" => "Les portes de Mascara et de Tiaret sont deux sites historiques situés au centre de la ville de Saïda, à proximité du complexe historique connu sous le nom de quartier de la redoute. Elles ont été construites pendant la réalisation de la citadelle militaire entre 1854 et 1857 par deux ingénieurs architectes européens.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5ae7b2b6-9df0-4429-9479-e8adb3d650d9", "translation" => "بوابات معسكر وتيارت هما موقعان تاريخيان يقعان في وسط مدينة سعيدة، بالقرب من المجمع التاريخي المعروف باسم حي الردوت. تم بنائهما أثناء إنشاء القلعة العسكرية بين عامي 1854 و1857 على يد اثنين من مهندسي الهندسة المعمارية الأوروبيين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //781
            ["id" => "5c004624-d568-4bfb-8fd3-217520793983", "translation" => "The Hammam Rabbi thermal resort is a popular destination offering modern facilities for relaxation and wellness vacations. With its therapeutic waters, advanced medical amenities, and recreational amenities, it provides a comprehensive experience for visitors seeking well-being and relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b0828e06-9316-494b-b43c-375770631133", "translation" => "La station thermale Hammam Rabbi est un lieu prisé offrant des installations modernes pour des vacances de détente et de soins. Avec ses eaux thérapeutiques, ses équipements médicaux avancés et ses aménagements de loisirs, elle offre une expérience complète aux visiteurs en quête de bien-être et de relaxation.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "853afdc4-09f8-428b-9240-10fb800b529d", "translation" => "منتجع حمام ربي هي وجهة شهيرة تقدم مرافق حديثة لقضاء عطلة الاسترخاء والعناية بالصحة. بفضل مياهها العلاجية ووسائل الرعاية الصحية المتقدمة ومرافق الترفيه، تقدم تجربة شاملة للزوار الباحثين عن الرفاهية والاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //782
            ["id" => "179a4c80-88dc-493c-b3c5-feeb72c2845a", "translation" => "The Tifrit waterfalls in Saida are a true natural treasure. They offer a breathtaking spectacle, a soothing atmosphere, and the opportunity to connect with nature in a preserved environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2aa63bf7-7113-4cbb-9d00-e3561f650326", "translation" => "Les cascades de Tifrit à Saïda sont un véritable trésor naturel. Elles offrent un spectacle à couper le souffle, une ambiance apaisante et la possibilité de se connecter avec la nature dans un environnement préservé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4b6a49e1-bec1-4b7e-a517-9f5fb054fbf7", "translation" => "شلالات تيفريت في سعيدة هي كنز طبيعي حقيقي. إنها تقدم عرضًا يأسر الألباب، وجوًا مهدئًا، وفرصة للاتصال مع الطبيعة في بيئة محمية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //783
            ["id" => "836c051e-32c5-423c-aff8-cf6757c49164", "translation" => "The city hall of Saïda is not only a symbol of local administration but also a testament to the city's history. With its central location, remarkable architecture, and administrative significance, it remains a place of interest for residents and visitors who want to explore the city's heritage and culture.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "df09f580-bba4-4ce3-af17-ecf2e9dff3e3", "translation" => "L'Hôtel de ville de Saïda est non seulement un symbole de l'administration locale, mais aussi un témoignage de l'histoire de la ville. Avec sa position centrale, son architecture remarquable et son importance administrative, il reste un lieu d'intérêt pour les habitants et les visiteurs qui souhaitent découvrir le patrimoine et la culture de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "20409f91-63a0-4082-b636-5ab7f0841e2a", "translation" => "مبنى بلدية سعيدة ليس مجرد رمز للإدارة المحلية ولكنه أيضًا شاهد على تاريخ المدينة. بفضل موقعه المركزي وهندسته الملحوظة وأهميته الإدارية، يبقى مكانًا يثير اهتمام السكان المحليين والزوار الذين يرغبون في استكشاف تراث وثقافة المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //784
            ["id" => "0a579203-e377-4253-8b78-59260a40bb5f", "translation" => "Whether for a leisurely stroll, a relaxing break, or to partake in a special event, the Emir Abdelkader square in Saida is a must-visit place that celebrates the historical and cultural heritage of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "373824fa-cac4-43d1-a727-3daad64aa4e0", "translation" => "Que ce soit pour une promenade tranquille, une pause détente ou pour participer à un événement spécial, la place Emir Abdelkader de Saïda est un lieu incontournable qui célèbre l'héritage historique et culturel de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2b08e181-1226-4595-90eb-db0e5e5742be", "translation" => "سواء كنت تبحث عن نزهة هادئة أو استراحة مريحة أو للمشاركة في حدث خاص، ساحة الأمير عبد القادر في سعيدة هي مكان لا بد من زيارته يحتفل بالتراث التاريخي والثقافي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //785
            ["id" => "ebcc1599-6be3-406d-a156-1826f5abd02c", "translation" => "Whether for a day trip or an extended stay, the Hounet waterfalls transport you to a world of natural beauty where tranquility and wonder abound. It's an ideal place to relax, reconnect with nature, and be enchanted by the splendor of these exceptional waterfalls.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8b9027c6-2b9b-48fe-90da-4ae2795f73a4", "translation" => "Que ce soit pour une escapade d'une journée ou pour un séjour plus long, les cascades de Hounet vous transportent dans un monde de beauté naturelle où la tranquillité et l'émerveillement sont au rendez-vous. C'est un endroit idéal pour se détendre, se reconnecter avec la nature et se laisser enchanter par la splendeur de ces cascades exceptionnelles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f3387e87-4722-4b90-b0cc-d184c6175de6", "translation" => "سواء كنت تخطط لقضاء يوم في الريف أو إقامة طويلة، تأخذك شلالات هونت إلى عالم من الجمال الطبيعي حيث الهدوء والإعجاب متواجدان بكثرة. إنه مكان مثالي للاسترخاء وإعادة الاتصال بالطبيعة والتأمل في روعة هذه الشلالات الاستثنائية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //786
            ["id" => "b620d66a-cc9c-42c5-8408-e4fb13a08529", "translation" => "Whether you're looking for a thermal spa treatment, a wellness getaway, or simply to enjoy a peaceful environment, the Ain Skhouna thermal resort offers an ideal retreat to rejuvenate and restore balance and vitality.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "157ca2b9-bee2-4a5d-9504-beed304ff3d6", "translation" => "Que ce soit pour une cure thermale, une escapade de bien-être ou simplement pour profiter d'un environnement paisible, la station thermale d'Ain Skhouna offre un refuge idéal pour se ressourcer et retrouver équilibre et vitalité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "04ba258a-1d17-4b9c-8d2c-0723e1dc4d02", "translation" => "سواء كنت تبحث عن علاج، أو عن تجربة للعافية، أو ببساطة للاستمتاع ببيئة هادئة، فإن منتجع عين السخونة تقدم ملاذًا مثاليًا لإعادة النشاط واستعادة التوازن والحيوية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //787
            ["id" => "c05c38dd-9a5a-43ce-8688-e25e0b0b70dd", "translation" => "The Sidi Aïssa thermal station offers a relaxing and therapeutic getaway, where visitors can enjoy the benefits of hot springs while discovering the culture and hospitality of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3f7f9197-7548-4a62-b396-501aab1f80a6", "translation" => "La station thermale de Sidi Aïssa offre ainsi une escapade relaxante et thérapeutique, où les visiteurs peuvent profiter des bienfaits des eaux chaudes tout en découvrant la culture et l'hospitalité de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "16e746be-8818-41cd-9c52-c833fbed07ee", "translation" => "منتجع سيدي عيسى تقدم مكانًا هادئًا وعلاجيًا للزوار، حيث يمكنهم الاستفادة من فوائد الينابيع الساخنة بينما يكتشفون ثقافة وضيافة المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //788
            ["id" => "e3c2f72f-1bfb-45f3-9029-4d17f408faee", "translation" => "The Bechar amusement park is a place of entertainment and leisure. It offers a fun and enjoyable experience for visitors of all ages.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6d410bb7-8781-4f28-97c5-936b4b85d6e7", "translation" => "Le parc d'attractions de Béchar est un lieu de divertissement et de loisirs. Il offre une expérience ludique et amusante pour les visiteurs de tous âges.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7e2abd19-b37f-401e-98ef-c80c746aedbe", "translation" => "حديقة التسلية في بشار هي مكان للترفيه تقدم تجربة ممتعة ومسلية لزوار جميع الأعمار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //789
            ["id" => "2e491941-7c12-432e-97d8-d1a38940db46", "translation" => "The museum of the mujahid in Bechar is a place of memory and recognition for those who sacrificed their lives for Algeria's independence. It also serves as a valuable source of information and education for visitors, allowing them to better understand and appreciate the history and struggle of the people for their freedom.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "92b50d63-c5fd-4d6c-ae37-80804c002eeb", "translation" => "Le musée du moudjahid de Béchar est un lieu de mémoire et de reconnaissance envers ceux qui ont sacrifié leur vie pour l'indépendance de l'Algérie. Il constitue également une source précieuse d'information et d'éducation pour les visiteurs, leur permettant de mieux comprendre et d'apprécier l'histoire et la lutte du peuple pour sa liberté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fb10187e-e347-44a8-817d-8506ccac6112", "translation" => "متحف المجاهد في بشار هو مكان للذاكرة والاعتراف بأولئك الذين قدموا تضحياتهم من أجل استقلال الجزائر. كما يعتبر مصدرًا قيمًا للمعلومات والتعليم للزوار، مما يسمح لهم بفهم وتقدير تاريخ ونضال الشعب من أجل حريته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //790
            ["id" => "dcb25570-30a2-4803-bc6b-45747d749cb0", "translation" => "The house of culture in Bechar plays a vital role in preserving, promoting, and celebrating the cultural richness of the region. It contributes to the artistic development of the local residents by providing a conducive space for creativity, cultural diversity, and the exchange of ideas.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "af056be8-24c0-4d66-9088-52f9fe9a0c4d", "translation" => "La maison de la culture de Béchar joue un rôle vital dans la préservation, la promotion et la célébration de la richesse culturelle de la région. Elle contribue à l'épanouissement artistique des habitants de la région en offrant un espace propice à la créativité, à la diversité culturelle et à l'échange d'idées.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7ced564e-9399-43c7-8905-695bbbd2abb7", "translation" => "دار الثقافة في بشار يلعب دورًا حيويًا في الحفاظ على التراث الثقافي وتعزيزه والاحتفال به في المنطقة. إنه يسهم في التنمية الفنية لسكان المنطقة المحليين من خلال توفير مساحة مناسبة للإبداع والتنوع الثقافي وتبادل الأفكار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //791
            ["id" => "f6126ed5-b8f4-40cf-b463-bbeeeebeaaff", "translation" => "The Bechar cinematheque plays a crucial role in promoting cinema as an art form and a means of cultural expression. It contributes to the cultural enrichment of the community by providing access to quality films and fostering the exploration of new artistic perspectives through the cinematic experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dd03f512-816a-4f8b-8a35-f82811807f7f", "translation" => "La cinémathèque de Béchar joue un rôle essentiel dans la promotion du cinéma en tant qu'art et moyen d'expression culturelle. Elle contribue à l'enrichissement culturel de la communauté en offrant un accès à des films de qualité et en favorisant la découverte de nouvelles perspectives artistiques à travers l'expérience cinématographique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "989696ea-3250-4bee-bdbb-9023e0e5cad5", "translation" => "سينماتيك بشار تلعب دورًا حيويًا في تعزيز السينما كفن ووسيلة للتعبير الثقافي. إنها تسهم في إثراء الثقافة في المجتمع من خلال توفير الوصول إلى أفلام عالية الجودة وتشجيع استكشاف وجهات نظر فنية جديدة من خلال تجربة السينما.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //792
            ["id" => "41b69209-c98d-4c8b-ac90-dce0c18ac9a8", "translation" => "In addition to artistic performances, the regional theater of Bechar also organizes workshops and training sessions. It plays an important role in promoting local talents and contributes to the artistic and cultural development of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "34102c82-6a4d-4bb9-bb59-676bdef43353", "translation" => "Outre les représentations artistiques, le théâtre régional de Béchar organise également des ateliers ainsi que des formations. Il joue un rôle important dans la promotion des talents locaux et contribue au développement artistique et culturel de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "06932f9f-6e0b-4648-9473-2f301cda59b8", "translation" => "بالإضافة إلى العروض الفنية، ينظم المسرح الجهوي في بشار أيضًا ورش عمل وجلسات تدريب. إنه يلعب دورًا هامًا في تعزيز المواهب المحلية ويسهم في التنمية الفنية والثقافية للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //793
            ["id" => "06a4f2b7-79fb-4b5c-9c00-2a8ddb70e8a9", "translation" => "The botanical garden of Bechar is an ideal place to connect with nature, escape the hustle and bustle of urban life, and discover the beauty and diversity of the plant kingdom.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b41d1e4a-af07-4b95-a13a-c9e616125abe", "translation" => "Le jardin botanique de Béchar constitue donc un lieu idéal pour se connecter avec la nature, s'évader du tumulte de la vie urbaine et découvrir la beauté et la diversité du règne végétal.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "507e6f6b-1b75-4bd2-8fc1-7f0faa8bb58c", "translation" => "حديقة النباتات في بشار هي مكان مثالي للاتصال بالطبيعة، والهروب من صخب الحياة الحضرية، واكتشاف جمال وتنوع عالم النباتات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //794
            ["id" => "e4193b94-729c-43e5-a4bb-c92099b2b24d", "translation" => "The Malek ibn el Houwayrith mosque is a place of worship with significant historical and religious importance. Originally, this building was a church known as Our Lady of the Sahara, but in 1974, it was converted into a mosque.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "407fad37-f6e9-44c2-9b15-76824252ba1d", "translation" => "La mosquée Malek ibn el Houwayrith, est un lieu de culte d'une grande importance historique et religieuse. À l'origine, cet édifice était une église connue sous le nom de Notre Dame du Sahara, mais en 1974, il fut converti en mosquée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "095ffbf6-a496-4e2c-a0c2-d6aa1421da13", "translation" => "المسجد مالك ابن الحويرث هو مكان عبادة ذو أهمية تاريخية ودينية كبيرة. في الأصل، كان هذا المبنى كنيسة تعرف باسم سيدة الصحراء، ولكن في عام 1974، تم تحويله إلى مسجد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //795
            ["id" => "317ddc81-ddde-428b-9746-8785dd63fd95", "translation" => "The chamber of crafts and trades of Bechar is a dynamic place that reflects the richness and diversity of local craftsmanship. It contributes to the preservation of traditional crafts while encouraging innovation and creativity. It is a must-visit for craft enthusiasts and those who want to discover the authenticity and talent of the region's artisans.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "befa0671-1e6f-4b90-b163-2c324d7154f3", "translation" => "La Chambre de l'artisanat et des métiers de Bechar est un lieu dynamique qui reflète la richesse et la diversité de l'artisanat local. Elle contribue à la préservation des traditions artisanales tout en encourageant l'innovation et la créativité. C'est un lieu incontournable pour les amateurs d'artisanat et pour ceux qui souhaitent découvrir l'authenticité et le talent des artisans de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "548cef94-473a-4f96-907c-3a532ef18d86", "translation" => "غرفة الصناعة والحرف ببشار هي مكان دينامي يعكس ثراء وتنوع الحرف المحلية. إنها تساهم في الحفاظ على الحرف التقليدية بينما تشجع على الابتكار والإبداع. إنها مكان يجب زيارته لعشاق الحرف وأولئك الذين يرغبون في اكتشاف أصالة وموهبة الحرفيين في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //796
            ["id" => "34acfa95-5186-460d-8e1b-7eab5170b88e", "translation" => "In addition to its role in providing drinking water, the Djorf Torba dam has become a true symbol of leisure and tourism in the region. It offers visitors the opportunity to enjoy the surrounding nature while raising awareness about the importance of preserving this precious space.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9cd7e84a-9c68-4cd6-93a7-2ff22cf64061", "translation" => "Le barrage de Djorf Torba, en plus de son rôle dans l'approvisionnement en eau potable, est ainsi devenu un véritable symbole de loisirs et de tourisme dans la région. Il offre aux visiteurs la possibilité de profiter de la nature environnante tout en sensibilisant à l'importance de préserver ce précieux espace.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fa941a63-f9a9-4aba-b984-35bcd240a763", "translation" => "بالإضافة إلى دوره في توفير مياه الشرب، أصبح سد جرف التربة رمزًا حقيقيًا للترفيه والسياحة في المنطقة. إنه يوفر للزوار فرصة الاستمتاع بالطبيعة المحيطة بينما يسهم في زيادة الوعي بأهمية الحفاظ على هذا المكان الثمين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //797
            ["id" => "c0b456f3-7b80-45b8-bfb1-3203a5d9f458", "translation" => "Whether for history enthusiasts, culture aficionados, or curious minds seeking new knowledge, the Kenadsa museum offers a captivating immersion into the past and present of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "917a9fbc-60a8-4e2a-b84f-3285cf19bf35", "translation" => "Que ce soit pour les amateurs d'histoire, les passionnés de culture ou les curieux en quête de nouvelles connaissances, le musée de Kenadsa offre une immersion captivante dans le passé et le présent de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0e170da4-8709-4de4-b346-98350c3eb7e0", "translation" => "سواء كان الأمر يتعلق بعشاق التاريخ أو عشاق الثقافة أو العقول الفضولية الباحثة عن معرفة جديدة، يقدم متحف القنادسة تجربة غامرة تأخذك في رحلة مثيرة إلى الماضي والحاضر للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //798
            ["id" => "24a30d07-9430-440c-94ad-a60c92d8553e", "translation" => "By visiting the kasbah of Kenadsa, you will discover a place steeped in history and spirituality, offering a fascinating insight into saharan culture.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "05783e16-3568-4e71-aa0d-9a755d19a3dd", "translation" => "En visitant la casbah de Kenadsa, vous découvrirez un lieu chargé d'histoire et de spiritualité, offrant un aperçu fascinant de la culture saharienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f1548317-1185-4fad-898d-ef473fc65ed1", "translation" => "من خلال زيارة قصبة القنادسة، ستكتشف مكانًا محملاً بالتاريخ والروحانية، ويقدم نظرة شيقة على ثقافة الصحراء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //799
            ["id" => "e247d481-a0db-4fcb-a4b9-486bc8424a9e", "translation" => "By visiting the Colonel Lotfi memorial, you will be immersed in the history of Algeria and have the opportunity to pay tribute to a man whose bravery left a lasting impact. It is a place filled with emotion and respect, providing reflection on the sacrifices made to achieve independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d69b44fe-032e-46e5-941a-bd61b01278df", "translation" => "En visitant le mémorial du Colonel Lotfi, vous serez immergé dans l'histoire de l'Algérie et vous pourrez rendre hommage à un homme dont le courage a marqué les mémoires. C'est un lieu chargé d'émotion et de respect, offrant une réflexion sur les sacrifices consentis pour obtenir l'indépendance.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ff317231-f67e-4148-8077-02a45d77f766", "translation" => "بزيارة مقام العقيد لطفي, ستتم عمقا في تاريخ الجزائر وستكون لديك الفرصة لتقديم العرفان لرجل بجرأته التي تركت أثرا دائما. إنه مكان مليء بالعاطفة والاحترام، ويوفر مجالًا للتفكير في التضحيات التي قدمت من أجل تحقيق الاستقلال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //800
            ["id" => "9c213290-f870-49c9-b643-dc96193f9731", "translation" => "The rock engravings of Taghit are a fascinating testament to prehistoric art dating back thousands of years. Nestled in the desert rocks, these engravings provide a unique glimpse into the life and culture of ancient civilizations that inhabited the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "34a116a3-15e9-485f-ac2c-c85466571bca", "translation" => "Les gravures rupestres de Taghit sont un témoignage fascinant de l'art préhistorique qui remonte à des milliers d'années. Nichées dans les roches du désert, ces gravures offrent un aperçu unique de la vie et de la culture des anciennes civilisations qui ont peuplé la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "af380c2f-a2e6-496e-a666-8d6a0b74715b", "translation" => "نقوش صخرية تاغيت هي شهادة رائعة على الفن ما قبل التاريخ التي تعود إلى آلاف السنين. موجودة في صخور الصحراء، تقدم هذه النقوش نظرة فريدة إلى حياة وثقافة الحضارات القديمة التي عاشت في هذه المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //801
            ["id" => "f41bb9db-55f0-42d1-ad3d-df65e02ffd0f", "translation" => "Ksar Taghit is a true journey through time, where you can admire the ancient ruined houses, colorful decorations, and carvings that bear witness to the history and culture of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2e380187-7b83-4ddd-81ab-53d7f2ab8dd6", "translation" => "Ksar Taghit est un véritable voyage dans le temps, où vous pourrez admirer les anciennes maisons en ruines, les décorations colorées et les gravures qui témoignent de l'histoire et de la culture de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f92ae711-1582-4efa-b26a-cc64a47bbc4b", "translation" => "قصر تاغيت هو رحلة حقيقية عبر الزمن، حيث يمكنك أن تعجب بالمنازل القديمة المدمرة، والزخارف الملونة، والنقوش التي تشهد على تاريخ وثقافة المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //802
            ["id" => "4464d2bd-379e-47ac-88b4-e84e2f2d479f", "translation" => "When visiting Dar Rawi in Taghit, you will have the opportunity to support local artisans and take home unique treasures that reflect the cultural identity of the region. It is a place where ancestral craftsmanship continues, and where each piece tells a fascinating story.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7700967a-5bf0-4212-b742-d9dffde85c1b", "translation" => "En visitant Dar Rawi à Taghit, vous aurez l'occasion de soutenir les artisans locaux et de ramener chez vous des trésors uniques qui témoignent de l'identité culturelle de la région. C'est un lieu où l'artisanat ancestral se perpétue et où chaque pièce raconte une histoire fascinante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c9f4e66f-901e-4313-9720-120d597aa5fa", "translation" => "عند زيارتك دار الراوي في تاغيت، ستكون لديك الفرصة لدعم الحرفيين المحليين واصطحاب الكنوز الفريدة التي تعكس الهوية الثقافية للمنطقة. إنه مكان حيث يتواصل الحرف التقليدية وحيث تروي كل قطعة قصةً مذهلةً.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //803
            ["id" => "738cf876-234d-4f77-868c-78235609281f", "translation" => "Immerse yourself in the ancient history of this extraordinary region and soak up its mysterious atmosphere. With its desert climate and breathtaking landscapes, the Tassili N'Ajjer national park is a must-visit destination for adventure and discovery enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d2709819-e629-4549-ade9-5dd7a392b7fc", "translation" => "Plongez dans l'histoire ancienne de cette région extraordinaire et imprégnez-vous de son atmosphère mystérieuse. Avec son climat désertique et des paysages à couper le souffle, le parc national du Tassili N'Ajjer est une destination incontournable pour les amateurs d'aventure et de découverte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cc134974-a49f-4e4b-b6f2-3dc37637503c", "translation" => "انغمس في تاريخ هذه المنطقة القديمة الاستثنائية وامتص جوها الغامض. مع مناخها الصحراوي ومناظرها الرائعة التي تأخذ الأنفاس، يعتبر الحظيرة الوطنية طاسيلي ناجر وجهة لا غنى عنها لعشاق المغامرة والاكتشاف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //804
            ["id" => "d2ebd870-5a63-482a-9368-1facdc0df8c7", "translation" => "The rock engravings of Tin Taghirt, dating back approximately 9-10,000 years, are among the treasures of the Tassili n'Ajjer. These engravings, from the Neolithic period, bear witness to a fascinating ancient history. They share many similarities with those from southern Oran, providing a unique perspective on the art and culture of the time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "accb61c1-690b-4182-be83-d7ad302ff695", "translation" => "Les gravures rupestres de Tin Taghirt, datant d'environ 9-10 000 ans, font partie des trésors du Tassili n'Ajjer. Ces gravures, d'âge néolithique, témoignent d'une histoire ancienne captivante. Elles présentent de nombreuses similitudes avec celles du Sud-oranais, offrant ainsi une perspective unique sur l'art et la culture de l'époque.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "51a891f0-fe65-4f71-a9b6-77708d81cc82", "translation" => "نقوش صخرية تين تغيرت، التي يعود تاريخها إلى ما يقرب من 9-10,000 سنة، هي من بين كنوز طاسيلي ناجر. هذه النقوش، التي تعود إلى العصر النيوليتي، تشهد على تاريخ قديم مثير للإعجاب. إنها تشترك في العديد من الشبهات مع تلك الموجودة في جنوب ولاية وهران، مما يوفر منظورًا فريدًا حول الفن والثقافة في تلك الفترة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //805
            ["id" => "e1a583b5-ae64-4151-a1ed-753d8a7a11ff", "translation" => "Oued Djerat is much more than just a watercourse; it offers a fascinating natural spectacle and a dive into the history of the region through its millennia-old engravings. Let yourself be captivated by the majesty of this canyon and the mystery of the engravings that adorn its banks. A unique experience awaits you in this extraordinary place in the heart of the Sahara.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "537ac64c-ed87-436e-a92d-a0e52bb9a994", "translation" => "Oued Djerat est bien plus qu'un simple cours d'eau, il offre un spectacle naturel fascinant et une plongée dans l'histoire de la région à travers ces gravures millénaires. Laissez-vous captiver par la majesté de ce canyon et l'énigme des gravures qui ornent ses rives. Une expérience unique vous attend dans cet endroit unique au cœur du Sahara.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4917b067-6b3d-4027-95b0-ddcab4e3f477", "translation" => "واد جرات ليس مجرد مجرى مائي بل يقدم عرضًا طبيعيًا رائعًا ورحلة عبر تاريخ المنطقة من خلال نقوشه القديمة التي تمتد لآلاف السنين. اسمحوا لأنفسكم أن تنجذبوا بعظمة هذه الوادي ولغز النقوش التي تزين شواطئه. تنتظركم تجربة فريدة في هذا المكان الاستثنائي في قلب الصحراء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //806
            ["id" => "f15183bc-e4fc-4735-9399-d18fee3e0b20", "translation" => "Ksar el Mihane, considered the oldest in the region, provides a fascinating insight into social organization and the division of tasks between men and women. Perched on a strategically chosen hill to protect the population from floods and tribal attacks.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bcad03e3-60f8-408b-997c-8396a2d34149", "translation" => "Ksar el Mihane, considéré comme le plus ancien de la région, offre un aperçu fascinant de l'organisation sociale et de la répartition des tâches entre hommes et femmes. Perché sur une colline stratégiquement choisie pour protéger la population des inondations et des attaques tribales.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "47d9fc29-7aa2-40a3-bc45-40bb4caace4b", "translation" => "قصر الميهان, الذي يُعتبر الأقدم في المنطقة، يقدم نظرة مثيرة على التنظيم الاجتماعي وتوزيع المهام بين الرجال والنساء. موجود على تلة تم اختيارها بعناية لحماية السكان من الفيضانات والهجمات القبلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //807
            ["id" => "04b40b8c-c618-41fa-80f9-017c41a2e5ab", "translation" => "The Tassili museum is a captivating place that allows visitors to delve into the ancient history of the region and appreciate the artistic richness of rock art. It is an ideal place to explore and understand the prehistoric culture of Tassili-N'ajjer.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d1d51bd0-328c-4eb2-a4f2-cd17792a4b8f", "translation" => "Le musée du Tassili est un lieu captivant qui permet aux visiteurs de plonger dans l'histoire ancienne de la région et d'apprécier la richesse artistique de l'art rupestre. C'est un endroit idéal pour explorer et comprendre la culture préhistorique du Tassili-N'ajjer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "eb37b61d-56df-494b-bd31-72b242da11e0", "translation" => "المتحف الطاسيلي هو مكان رائع يسمح للزوار بالانغماس في تاريخ العصور القديمة للمنطقة و تقدير الثراء الفني للفن الصخري. إنه مكان مثالي لاستكشاف وفهم الثقافة ما قبل التاريخ في طاسيلي ناجر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //808
            ["id" => "fdb1810b-377a-4d00-bb5c-1e5cab4e3832", "translation" => "The archaeological site of Sefar, located in Djanet, is a true wonder of world heritage. Nestled in the heart of the Tassili n'Ajjer mountain range, this troglodyte city is famous for its thousands of petrified houses, earning it the nickname 'City of Caves'.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "99ea671d-b25f-48ad-b305-32379fe431db", "translation" => "Le site archéologique de Sefar, situé à Djanet, est une véritable merveille du patrimoine mondial. Nichée au cœur de la chaîne montagneuse du Tassili n'Ajjer, cette ville troglodyte est célèbre pour ses milliers de maisons pétrifiées, ce qui lui a valu le surnom de 'ville des grottes'.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "98db1779-ae62-4488-857e-b2967d46268d", "translation" => "الموقع الأثري في سيفار، الواقع في جانت، هو عجب حقيقي من التراث العالمي. تقع هذه المدينة الصخرية في قلب سلسلة جبال طاسيلي ناجر واشتهرت بآلاف المنازل المتحجرة بها، مما أكسبها لقب 'مدينة الكهوف'.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //809
            ["id" => "746937b0-f249-4c55-9925-1535f878dc6f", "translation" => "The Tamrit canyon is a place of stunning beauty, offering a unique experience to travelers who venture into this region. Whether it's to admire the impressive geological formations, explore the remnants of the past, or simply be enchanted by the majesty of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1a48521a-90e4-4532-ab0f-c81356721f68", "translation" => "Le canyon de Tamrit est un endroit d'une beauté saisissante, offrant une expérience unique aux voyageurs qui s'aventurent dans cette région. Que ce soit pour admirer les formations géologiques impressionnantes, explorer les vestiges du passé ou simplement se laisser envoûter par la majesté de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "48d2ea4c-bbca-411a-8b76-f02bfc95bb21", "translation" => "تعدّ كانيون تامريت مناطق ذات جمال استثنائي، وهو يقدم تجربة فريدة للمسافرين الذين يغامرون في هذه المنطقة. سواء للتعجب من التشكيلات الجيولوجية المذهلة، أو استكشاف آثار الماضي، أو ببساطة لتعرّف على عظمة الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //810
            ["id" => "0745792a-2045-4753-af27-d605a9aa0995", "translation" => "The 'Crying Cow' is an exceptionally well-preserved archaeological site, providing valuable insights into the art and life of past civilizations. It's a place that inspires wonder and curiosity, inviting visitors to explore and immerse themselves in its unique cultural and artistic heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cd275066-413c-4074-8de5-6de04c453367", "translation" => "La vache qui pleure est un site archéologique exceptionnellement préservé, offrant un aperçu précieux de l'art et de la vie des civilisations passées. C'est un lieu qui suscite l'émerveillement et la curiosité, invitant les visiteurs à explorer et à s'imprégner de son héritage culturel et artistique unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c5815c6b-9ff5-44ba-96d6-fafd566e4a54", "translation" => "البقرة الباكية هي موقع أثري استثنائياً محفوظ بشكل استثنائي، يقدم نظرة قيمة إلى الفن والحياة في الحضارات الماضية. إنه مكان يثير الدهشة والفضول، مما يدعو الزوار إلى استكشافه والانغماس في تراثه الثقافي والفني الفريد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //811
            ["id" => "fdd279df-d425-4864-9f34-5009967c4478", "translation" => "Ksar Adjahil is a historical site that deserves to be visited during a stay in Djanet. It is a living testimony of the cultural and architectural heritage of the region, offering visitors an immersive experience into the fascinating past of this part of the country.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "baacaaf5-9ba9-4fb7-aa76-d2194e54a133", "translation" => "Ksar Adjahil est un site historique qui mérite d'être visité lors d'un séjour à Djanet. C'est un témoignage vivant du patrimoine culturel et architectural de la région, offrant aux visiteurs une expérience immersive dans le passé fascinant de cette partie du pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3f920856-a295-4d7f-8aba-df1bc25234f7", "translation" => "قصر أجاهيل هو موقع تاريخي يستحق الزيارة أثناء إقامتك في جانت. إنه شاهد حي للتراث الثقافي والمعماري للمنطقة، حيث يقدم للزوار تجربة غامرة في الماضي الساحر لهذا الجزء من البلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //812
            ["id" => "26d9914e-637b-4bf7-a7b3-ac98065c288b", "translation" => "The reptile park is a real opportunity to get closer to these fascinating creatures, learn to understand them, and raise awareness about their conservation. Whether you're passionate about reptiles or just curious to discover the diversity of the local wildlife, this park offers a unique and enriching experience for all visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2827e1bf-5af7-4f4b-87c5-ddc413424165", "translation" => "Le parc des reptiles est une véritable opportunité de se rapprocher de ces fascinantes créatures, d'apprendre à les comprendre et de sensibiliser à leur conservation. Que l'on soit passionné par les reptiles ou simplement curieux de découvrir la diversité de la faune locale, ce parc offre une expérience unique et enrichissante pour tous les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "da07abc3-1493-4088-a25d-b0f1e0b5548a", "translation" => "حديقة الزواحف هو فرصة حقيقية للتواصل مع هذه المخلوقات الرائعة، وتعلم كيفية فهمها وزيادة الوعي حول حفظها. سواء كنت متحمسًا للزواحف أم مجرد فضولي لاكتشاف تنوع الحياة البرية المحلية، يقدم هذا المتنزه تجربة فريدة ومثرية لجميع الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //813
            ["id" => "9365b327-01b8-4c2e-8cee-800dcd70fea9", "translation" => "Whether you're an animal enthusiast, a nature lover, or just looking for an entertaining getaway, this zoological park is an ideal place to discover and explore the fascinating world of animals.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "db54ca09-fb4d-4487-8b25-8448877391d0", "translation" => "Que vous soyez un amateur d'animaux, un passionné de nature ou simplement à la recherche d'une escapade divertissante, ce parc zoologique est un endroit idéal pour découvrir et explorer le monde fascinant des animaux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dffc6582-b652-4f2b-b904-8e377b7471ad", "translation" => "سواء كنت عاشقًا للحيوانات، أو عاشقًا للطبيعة، أو مجرد بحثك عن رحلة ممتعة، هذه حديقة الحيوانات هي مكان مثالي لاستكشاف عالم الحيوانات الرائع والمثير.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //814
            ["id" => "e5ffe18d-8b70-482a-a70b-61818c85d1da", "translation" => "Ksar Ghardaia, founded in 1048, is a historic city located upstream from the M'zab valley. Nicknamed the 'pearl of the oases' and the capital of the M'zab valley, it is renowned for its nearly perfect concentric radial geometric layout.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "35bacbc7-6a80-4482-9e5d-505fdb6a5695", "translation" => "Ksar Ghardaïa, fondé en 1048, est une ville historique située en amont de la vallée du M'zab. Surnommée la 'perle des oasis' et la capitale de la vallée du M'zab, elle est réputée pour sa configuration géométrique radio concentrique presque parfaite.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "177c22f3-16f9-473f-9f6e-5fbbe7463d55", "translation" => "قصر غرداية، تأسس في عام 1048، هو مدينة تاريخية تقع في أعالي وادي المزاب. يُلقب بـ 'لؤلؤة الواحات' وعاصمة وادي المزاب، وهو مشهور بتخطيطه الهندسي الشعاعي التركيبي الذي يكاد يكون مثاليًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //815
            ["id" => "0c0b5cc3-a01a-44e3-baeb-c538514de78d", "translation" => "The amusement park offers a blend of fun, excitement, and entertainment for the whole family, creating a memorable experience for visitors of all ages.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b7b0a959-f4d6-46df-8360-60cfd76af27e", "translation" => "Le parc d'attractions offre un mélange d'amusement, d'excitation et de divertissement pour toute la famille, créant ainsi une expérience mémorable pour les visiteurs de tous âges.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d7f2178b-bb63-4c88-afd0-56e8e9cd968a", "translation" => "حديقة التسلية تقدم مزيجًا من المرح والإثارة والترفيه للعائلة بأكملها، مما يخلق تجربة لا تُنسى لزوار جميع الأعمار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //816
            ["id" => "60f01008-560c-4812-bf64-0f17c0e65488", "translation" => "The Oasis center is the perfect place to rejuvenate, relax, and focus on physical and mental well-being. Whether for a day of relaxation or a longer stay, visitors can take advantage of the facilities and services offered to regain balance and vitality.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9ea21ba5-664f-4825-ac81-2bb219a5550f", "translation" => "Le centre Oasis est l'endroit idéal pour se ressourcer, se relaxer et se concentrer sur le bien-être physique et mental. Que ce soit pour une journée de détente ou un séjour plus long, les visiteurs peuvent profiter des installations et des services proposés pour retrouver l'équilibre et la vitalité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8ac071e5-4f6f-49f6-b250-e465251f6fbb", "translation" => "مركز الواحات هو المكان المثالي للاسترخاء والاستراحة والتركيز على العافية البدنية والنفسية. سواءً كنت تبحث عن يوم من الاسترخاء أو إقامة أطول، يمكن للزوار الاستفادة من المرافق والخدمات المقدمة لاستعادة التوازن والحيوية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //817
            ["id" => "4d635e28-fd62-47b4-a403-590a14c41101", "translation" => "Ksar el Atteuf, located downstream of the M'zab valley, is a true architectural and historical gem. Founded in 1012 by Sheikh Khalifa Bin Abghour, it marks the beginning of urbanization in the M'zab valley. This site is distinguished by the presence of two mosques within its enclosure, each with its own pyramid-shaped minaret.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4c26bc0c-f9d2-49c9-8cb5-2de7a9611b61", "translation" => "Ksar el Atteuf, situé en aval de la vallée du M'zab, est un véritable joyau architectural et historique. Fondé en 1012 par le Cheikh Khalifa Ben Abghour, il marque le début de l'urbanisation de la vallée du M'zab. Ce site se distingue par la présence de deux mosquées à l'intérieur de son enceinte, chacune possédant son propre minaret de forme pyramidale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2d2600d2-80a2-4ff3-9a10-fe450c6fc8e4", "translation" => "قصر العطف, الواقع في أسفل وادي المزاب، هو جوهرة معمارية وتاريخية حقيقية. تأسس في عام 1012 من قبل الشيخ خليفة بن أبغور، ويمثل بداية عملية التمدن في وادي المزاب. يتميز هذا الموقع بوجود مسجدين داخل سوره، كل منهما يمتلك منارته الخاصة بشكل هرمي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //818
            ["id" => "352cd487-2ad9-49e1-bd72-6d13b885711f", "translation" => "The mosque of Sidi Brahim is a remarkable example of local architecture and the ingenuity of artisans from the M'zab valley. It embodies the harmony between geometric forms, vibrant colors, and natural materials, creating a place of worship imbued with beauty and spirituality.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "33d9266e-838a-4d39-8a4f-97a7191c026a", "translation" => "La mosquée de Sidi Brahim est un exemple remarquable de l'architecture locale et de l'ingéniosité des artisans de la vallée du M'zab. Elle incarne l'harmonie entre les formes géométriques, les couleurs vives et les matériaux naturels, créant ainsi un lieu de culte empreint de beauté et de spiritualité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9d62628f-03a4-41fb-924e-350636b6a284", "translation" => "مسجد سيدي ابراهيم هو مثال ملحوظ على العمارة المحلية وبراعة حرفيي وادي المزاب. إنه يجسد التناغم بين الأشكال الهندسية والألوان الزاهية والمواد الطبيعية، مما يخلق مكان عبادة ممزوج بالجمال والروحانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //819
            ["id" => "9d644f80-0756-4d3f-b99e-1762320b2a2c", "translation" => "By visiting Ksar Malika, you will be enchanted by its captivating history and preserved authenticity. You can also participate in the annual 'Ziyara' events, where local history is shared, and traditions are perpetuated.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f7ae2507-2466-42be-8325-a30b11f68905", "translation" => "En visitant ksar Malika, vous serez enchantés par son histoire captivante et son authenticité préservée. Vous pourrez également participer aux événements annuels de la 'Ziyara', où l'histoire locale est partagée et les traditions perpétuées.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "356e095c-13bc-4aff-894d-2a6f190f69bd", "translation" => "بزيارة قصر مليكة، ستُسحر بتاريخها المثير وأصالتها المحتفظة. يمكنك أيضًا المشاركة في فعاليات 'الزيارة' السنوية، حيث يتم مشاركة التاريخ المحلي والمحافظة على التقاليد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //820
            ["id" => "48fc2479-fbde-46e5-8a46-7f4d79045e44", "translation" => "By visiting Ksar Bounoura, you will be immersed in an atmosphere steeped in history and tradition. The winding streets, fortified houses, and majestic cemeteries take you on a journey through time. You can admire the architectural ingenuity of the inhabitants who made the most of the natural landscape to create a true fortress.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "25e6a5f3-3b8f-4c69-a257-34d91da7189c", "translation" => "En visitant ksar Bounoura, vous serez plongés dans une atmosphère empreinte d'histoire et de tradition. Les ruelles sinueuses, les maisons fortifiées et les cimetières majestueux vous transportent dans un voyage à travers le temps. Vous pourrez admirer l'ingéniosité architecturale des habitants qui ont su tirer parti du paysage naturel pour créer une véritable forteresse.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0bb1c77b-ee2d-4ae1-b0ae-1e44a7010f8c", "translation" => "بزيارة قصر بنورة، ستغمر نفسك في جو ينبض بالتاريخ والتقاليد. الشوارع المتعرجة، والمنازل المحصنة، والمقابر الفخمة تأخذك في رحلة عبر الزمن. يمكنك أن تعجب بالبراعة المعمارية للسكان الذين استفادوا إلى أقصى حد من التضاريس الطبيعية لخلق حصن حقيقي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //821
            ["id" => "6b7b50cd-e772-4fa6-ae24-06652bc040b4", "translation" => "By visiting the museum of antiquities in Ghardaia, you will be taken on a captivating journey through time, exploring the wonders of ancient civilizations and uncovering the hidden treasures of the region. An enriching experience awaits you, where history and culture come together to provide you with a unique insight into the region and its exceptional heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a22f99f8-d4b7-4af2-b5d0-e7820e093b39", "translation" => "En visitant le musée des antiquités de Ghardaïa, vous serez transportés dans un voyage captivant à travers le temps, explorant les merveilles des civilisations anciennes et découvrant les trésors cachés de la région. Une expérience enrichissante vous attend, où l'histoire et la culture se mêlent pour vous offrir une vision unique de la région et de son patrimoine exceptionnel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "abd7526b-d141-4f02-a330-af95f1801304", "translation" => "بزيارة متحف الآثار في غرداية، ستُنقَل إلى رحلة جذابة عبر الزمن، حيث ستكتشف عجائب الحضارات القديمة وتكتشف كنوز الإقليم المخفية. تنتظرك تجربة غنية، حيث تتداخل التاريخ والثقافة لتقديم لك رؤية فريدة عن الإقليم وتراثه الاستثنائي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //822
            ["id" => "fe709854-a9ce-4b4a-ad3e-1cb4899581fd", "translation" => "Whether you're a nature enthusiast, a parent looking for a playground for your children, or simply curious about exploring the local wildlife and flora, the Tafilalt ecological park invites you to have a pleasant and enriching time in the heart of preserved nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9376b33b-d3fb-4fba-8398-832b0c2532c1", "translation" => "Que vous soyez un amoureux de la nature, un parent à la recherche d'un espace de jeux pour vos enfants ou simplement curieux de découvrir la faune et la flore de la région, le parc écologique de Tafilalt vous invite à passer un moment agréable et enrichissant au cœur de la nature préservée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "55509743-71a7-4850-869e-b29ea8106b3c", "translation" => "سواء كنت عاشقًا للطبيعة، أو والدًا يبحث عن مكان للعب لأطفالك، أو مجرد فضولي يرغب في استكشاف الحياة البرية والنباتات في المنطقة، تدعوك حديقة تافيلالت البيئية لقضاء وقت ممتع ومثرٍ في قلب الطبيعة المحمية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //823
            ["id" => "093704fc-2967-4ca7-a9d0-709133e24acc", "translation" => "Ksar Beni Isguen is an ancient city that has preserved its organizational model since its foundation in 1347. Its complete defensive enclosure, lined inside with a winding alley dotted with watchtowers, bears witness to its historical significance and resilience over the centuries.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3da9dffc-389b-4831-b3f3-0cc62e2058a0", "translation" => "Le ksar Beni Isguen est une cité ancienne qui a su préserver son modèle organisationnel depuis sa fondation en 1347. Son enceinte défensive complète, bordée à l'intérieur par une ruelle parsemée de tours de guet, témoigne de son caractère historique et de sa résilience au fil des siècles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ba633dea-c6f1-4492-979f-88fefccc87fe", "translation" => "قصر بني يزڨن مدينة قديمة تمكنت من الحفاظ على نموذجها التنظيمي منذ تأسيسها في عام 1347. حاجبها الدفاعي الكامل، المحاط من الداخل بزقاق متعرج مزين ببرج المراقبة، يشهد على أهميتها التاريخية وصمودها على مر القرون.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //824
            ["id" => "202b5233-db36-4868-b9b3-194d7e91e87a", "translation" => "Through its exhibitions and historical documents, the museum pays tribute to the freedom fighters who bravely fought against colonialism for Algeria's independence. The museum's halls house authentic objects, photographs, uniforms, weapons, and other artifacts related to this crucial period in history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ab94d811-8e4e-43c5-8c0c-2e8e121bd8b4", "translation" => "À travers ses expositions et ses documents historiques, le musée rend hommage aux combattants de la liberté, qui ont courageusement lutté contre le colonialisme pour l'indépendance de l'Algérie. Les salles du musée abritent des objets authentiques, des photographies, des uniformes, des armes et d'autres artefacts liés à cette période cruciale de l'histoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5d406dc6-b408-4944-8e18-5e751cf0a5fb", "translation" => "من خلال معارضه ووثائقه التاريخية، يكرم المتحف المقاتلين من أجل الحرية الذين قاتلوا بشجاعة ضد الاستعمار من أجل استقلال الجزائر. تضم قاعات المتحف أشياء أصيلة، وصور فوتوغرافية، وزيّات، وأسلحة، وقطع فنية أخرى متعلقة بهذه الفترة الحاسمة في التاريخ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //825
            ["id" => "4ad8b92f-d475-454c-bc5a-da515711029f", "translation" => "Whether for a relaxing solo getaway or a family retreat, the Zelfana thermal resort provides a comprehensive wellness experience. Visitors can unwind and rejuvenate in an enchanting natural setting while enjoying the benefits of the thermal waters.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c60e36dc-c233-4fdf-952c-50eb4bbfe764", "translation" => "Que ce soit pour une escapade relaxante en solo ou en famille, la station thermale de Zelfana offre une expérience complète de bien-être. Les visiteurs peuvent se reposer et se ressourcer dans un cadre naturel enchanteur, tout en bénéficiant des bienfaits des eaux thermales.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5aede68a-2858-4b59-820b-cdf076d78b2b", "translation" => "سواء كنت تبحث عن قضاء إجازة هادئة بمفردك أو عطلة عائلية، تقدم منتجع زلفانة الصحي تجربة شاملة للعافية. يمكن للزوار الاسترخاء واستعادة نشاطهم في بيئة طبيعية ساحرة والاستفادة من فوائد المياه الحرارية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //826
            ["id" => "1c098801-e3bd-4938-adb6-0d9d7a2da746", "translation" => "In addition to its use for film screenings, the Ghardaia cinema also serves as a theater for local troupes. It thus becomes an essential cultural space where local artists and actors can perform and share their art with the community. This duality as both a cinema and theater contributes to maintaining the city's cultural life and promoting local artistic expression.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a36dc3aa-8f35-475b-a698-83e17c872fc2", "translation" => "Outre son utilisation pour les projections cinématographiques, le cinéma de Ghardaïa sert également de théâtre pour des troupes locales. Il devient ainsi un espace culturel essentiel où les artistes et les acteurs locaux peuvent se produire et partager leur art avec la communauté. Cette dualité en tant que cinéma et théâtre contribue à maintenir la vie culturelle de la ville et à favoriser l'expression artistique locale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "87d26d7f-b79b-46a7-bb43-d8de0e1a9bee", "translation" => "بالإضافة إلى استخدامه كمكان لعروض الأفلام، يخدم سينما غرداية أيضًا كمسرح للفرق المحلية. وبالتالي، يصبح مكانًا ثقافيًا أساسيًا حيث يمكن للفنانين والممثلين المحليين أداء أعمالهم ومشاركة فنهم مع المجتمع. تلك الثنائية ككيان سينمائي ومسرحي تساهم في الحفاظ على الحياة الثقافية في المدينة وتعزيز التعبير الفني المحلي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //827
            ["id" => "0bd0f88b-3741-4c6a-b7b8-e811b9bbed36", "translation" => "The statue of Ferhat Abbas is a sculpture that pays tribute to an important political figure in the history of Algeria and aims to commemorate and honor his role in the struggle for the country's independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "73174905-8f60-44a9-8247-b4e9fbbbe91f", "translation" => "La statue de Ferhat Abbas est une sculpture qui rend hommage à une figure politique importante de l'histoire de l'Algérie et vise à commémorer et à honorer son rôle dans la lutte pour l'indépendance du pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "43980442-3314-4506-ae97-54b015431980", "translation" => "تمثال فرحات عباس هو نحت يكرم شخصية سياسية مهمة في تاريخ الجزائر ويهدف إلى إحياء وتكريم دوره في النضال من أجل استقلال البلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //828
            ["id" => "8e9b1ddc-2d1f-4342-a280-5e67490d0844", "translation" => "The monument of Sidi Abaz is an exceptional structure, lavishly decorated and adorned with distinctive architectural elements typical of the regional architecture.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d43a54d7-3f4b-4f05-b8e1-4df47f086b4d", "translation" => "Le monument de Sidi Abaz à Ghardaïa est une structure exceptionnelle, richement décorée et ornée d'éléments architecturaux distinctifs typiques de l'architecture régionale. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3e0fa004-735e-44d9-ac72-f1ec9baf2d76", "translation" => "نصب سيدي اعباز هو هيكل استثنائي، مزين بفخر ومزود بعناصر معمارية مميزة تعكس طابع العمارة الإقليمية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //829
            ["id" => "882567c8-f00b-48cb-a665-39230dff8f9b", "translation" => "When visiting the Ouargla museum of the Mujahid, visitors have the opportunity to delve into the history of Algeria and appreciate the courage and determination of the mujahideen. It is a place of remembrance that allows paying tribute to those who contributed to the country's independence and preserving their legacy for future generations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "af6cb89b-0cf2-4bbb-843a-4d81e19089a0", "translation" => "En visitant le musée du moudjahid de Ouargla, les visiteurs ont l'opportunité de se plonger dans l'histoire de l'Algérie et d'apprécier le courage et la détermination des moudjahidine. C'est un lieu de mémoire qui permet de rendre hommage à ceux qui ont contribué à l'indépendance du pays et de préserver leur héritage pour les générations futures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "43c19b6e-26c3-4d4c-a555-d1fc157eb896", "translation" => "عند زيارة متحف المجاهد في ورقلة، يتاح للزوار فرصة التعمق في تاريخ الجزائر وتقدير شجاعة وإصرار المجاهدين. إنه مكان للتذكير يسمح بتكريم الذين ساهموا في استقلال البلاد والمحافظة على إرثهم للأجيال القادمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //830
            ["id" => "03b91d3e-d503-442c-97ba-ede864736793", "translation" => "Hoping for new initiatives and artistic programming to develop, the open-air theater of Ouargla continues to embody the artistic potential of the region and holds the hope of one day seeing its stage come alive with captivating theatrical and artistic performances.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d85d9a82-9384-43c4-8b3e-fc5684a56096", "translation" => "En espérant que de nouvelles initiatives et programmations artistiques se développent, le théâtre en plein air de Ouargla continue d'incarner le potentiel artistique de la région et suscite l'espoir de voir un jour sa scène animée par des représentations théâtrales et artistiques captivantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "01e679a6-dfd0-461f-bb28-ddaca5f8c44d", "translation" => "على أمل أن تتطور مبادرات جديدة وبرامج فنية، يستمر مسرح الهواء الطلق في ورقلة في تجسيد الإمكانيات الفنية للمنطقة ويثير أملًا في رؤية مسرحه ينبض يومًا بعروض مسرحية وفنية مثيرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //831
            ["id" => "62c7ab0b-0620-4779-90af-72c99c65e410", "translation" => "A visit to the museum allows visitors to explore the history and cultural richness of the Ouargla region, as well as immerse themselves in the captivating atmosphere of the desert. It is a must-visit place for history enthusiasts, culture enthusiasts, and anyone looking to discover the treasures of the Sahara.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "59af7a9e-76ce-4741-b872-6d813b686a58", "translation" => "Une visite au musée permet aux visiteurs de découvrir l'histoire et la richesse culturelle de la région de Ouargla, ainsi que de s'immerger dans l'atmosphère envoûtante du désert. C'est un lieu incontournable pour les amateurs d'histoire, les passionnés de culture et tous ceux qui souhaitent explorer les trésors du Sahara.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "93005059-8d67-493b-9f3a-53f1564498d0", "translation" => "زيارة المتحف تتيح للزوار استكشاف تاريخ وثراء الثقافة في منطقة ورقلة، فضلاً عن الانغماس في أجواء الصحراء الساحرة. إنها مكان يجب زيارته لهواة التاريخ وعشاق الثقافة ولجميع الذين يتطلعون لاستكشاف كنوز الصحراء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //832
            ["id" => "caf8c632-55b1-47fd-8c02-a28b1538b085", "translation" => "The house of culture in Ouargla is a dedicated space for the promotion of arts and culture in the region. It provides a dynamic platform for local and national artists, as well as for art enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "53e206a2-d520-44b1-8848-cd3cf02ac317", "translation" => "La maison de la culture de Ouargla est un espace dédié à la promotion des arts et de la culture dans la région. Elle offre une plateforme dynamique pour les artistes locaux et nationaux, ainsi que pour les amateurs d'art.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "49d62a86-4ce9-4f77-a57f-edd70e4ef25a", "translation" => "دار الثقافة في ورقلة هي مكان مخصص لتعزيز الفنون والثقافة في المنطقة. إنها منصة ديناميكية للفنانين المحليين والوطنيين، وكذلك لهواة الفن.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //833
            ["id" => "d12c3aa6-44e5-44ea-89ee-fa80f08bbc58", "translation" => "By exploring Ksar Ouargla, you can immerse yourself in its rich history and discover its traditional architecture, narrow alleys, and authentic atmosphere. It's a fascinating place where history and culture intersect, offering visitors a unique and immersive experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9d10011a-68d5-437d-8337-d41d83baccee", "translation" => "En explorant Ksar Ouargla, vous pourrez vous immerger dans son riche passé et découvrir son architecture traditionnelle, ses ruelles étroites et son ambiance authentique. C'est un lieu fascinant où l'histoire et la culture se rencontrent, offrant aux visiteurs une expérience unique et immersive.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "94ff2d95-3aba-454c-8671-a4dbb8f7de4c", "translation" => "باستكشاف قصر ورقلة، يمكنكم أن تغمروا أنفسكم في تاريخها الغني وتكتشفوا هندسة بنائها التقليدية وأزقتها الضيقة وجوها الأصيل. إنه مكانٌ مذهل حيث يتقاطع التاريخ والثقافة، مما يقدم للزوار تجربة فريدة وغامرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //834
            ["id" => "5d8c03dd-885f-4d2a-8dfe-18ae9d243b03", "translation" => "Chott Oum el Raneb is a unique natural site characterized by a permanent body of water surrounded by sand dunes. Fed by the wastewater of five establishments, it provides an essential refuge for migratory and wintering birds that cross the desert during their migrations between Africa and Eurasia.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d29622a4-86b2-4095-8747-9decc8f99ddc", "translation" => "Chott Oum el Raneb est un site naturel unique, caractérisé par une étendue d'eau permanente entourée de dunes de sable. Alimenté par les eaux usées de cinq établissements, il offre un refuge essentiel pour les oiseaux migrateurs et hivernants qui traversent le désert lors de leurs migrations entre l'Afrique et l'Eurasie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "79a64634-043b-4d8e-86e5-84c3d0c37647", "translation" => "شط أم الرانب هو موقع طبيعي فريد من نوعه، يتميز بجسم مائي دائم محاط بكثبان رملية. يتم تغذيته بمياه الصرف الصحي من خمسة مؤسسات، مما يوفر ملاذًا أساسيًا للطيور المهاجرة والشتوية التي تعبر الصحراء أثناء هجراتها بين أفريقيا وأوراسيا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //835
            ["id" => "62e67615-d4da-49f3-a34a-64a16d7a1bcb", "translation" => "Chott Ain Beida is a picturesque salt flat surrounded by lush palm groves and intersected by several channels that provide drainage for excess water from plantations and the nearby town. This place serves as a crucial stopover for many migratory bird species along the Africa-Eurasia flyway.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4cba7fb2-12ee-40ef-aad2-96b281c4611e", "translation" => "Chott Ain Beida est une dépression salée pittoresque entourée de palmeraies verdoyantes et traversée par plusieurs canaux qui assurent le drainage des eaux excédentaires des plantations et de la ville voisine. Cet endroit constitue une escale importante pour de nombreuses espèces d'oiseaux migrateurs de la voie Afrique-Eurasie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0116e995-7834-4cf2-9316-32d663d81d09", "translation" => "شط عين البيضاء هو مسطح ملحي جميل يحاط بنخيل خصبة ويتقاطع معه العديد من القنوات التي توفر التصريف للمياه الزائدة من الزراعات والمدينة القريبة. يعتبر هذا المكان محطة هامة للعديد من أنواع الطيور المهاجرة على مسارها بين أفريقيا وآسيا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //836
            ["id" => "9f03b129-6c12-4959-95b7-c7e24f46be0c", "translation" => "This site is a true testament to the past, offering visitors the opportunity to admire traditional architecture and explore the various aspects of life in this region. Whether you are fascinated by history, architecture, or simply curious to discover new horizons, Ksar N'goussa will transport you on a captivating journey through time and culture.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c26ea91a-ea46-4ef1-85c9-999424c6144e", "translation" => "Ce site est un véritable témoin du passé, offrant aux visiteurs l'opportunité d'admirer l'architecture traditionnelle et d'explorer les différentes facettes de la vie dans cette région. Que vous soyez fasciné par l'histoire, l'architecture ou simplement curieux de découvrir de nouveaux horizons, le Ksar N'goussa vous transportera dans un voyage captivant à travers le temps et la culture.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "175a1de7-7c1d-4887-9467-fa237a20cbda", "translation" => "هذا الموقع هو شاهد حي للماضي، يقدم للزوار الفرصة للتعرف على العمارة التقليدية واستكشاف جوانب مختلفة من الحياة في هذه المنطقة. سواء كنت مفتونًا بالتاريخ أو العمارة أو مجرد فضول لاكتشاف آفاق جديدة، سينقلك قصر أنقوسة في رحلة جذابة عبر الزمن والثقافة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //837
            ["id" => "4582e006-915b-446e-a1b8-906bf2d5d247", "translation" => "In addition to the attractions, the park also has green spaces where visitors can relax, have picnics, and enjoy the beautiful scenery. Food stalls and shops are also available to cater to the dining and souvenir needs of visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "344f8bc2-2045-4d10-aca6-3f50b1baa61a", "translation" => "En plus des attractions, le parc dispose également d'espaces verts où les visiteurs peuvent se détendre, pique-niquer et profiter du beau paysage. Des stands de restauration et des boutiques sont également présents pour répondre aux besoins des visiteurs en matière de restauration et de souvenirs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0a632790-2dac-46b6-8f46-1752dd677b77", "translation" => "بالإضافة إلى الألعاب، تحتوي الحديقة أيضًا على مساحات خضراء يمكن للزوار الاسترخاء فيها وتناول وجبات والاستمتاع بالمناظر الجميلة. كما تتوفر أيضًا محلات بيع الطعام والمتاجر لتلبية احتياجات الزوار من الطعام والهدايا التذكارية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //838
            ["id" => "4834d500-7137-4bda-92f7-dd218d4907ac", "translation" => "Whether it's for a leisurely stroll along its banks, a family picnic, or simply to enjoy the natural beauty of this ecosystem, the Hassi Ben Abdallah lake is an ideal place to relax and connect with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2e758dc8-89da-438d-8f37-d2311d8e0980", "translation" => "Que ce soit pour une promenade tranquille le long de ses rives, une séance de pique-nique en famille ou simplement pour profiter de la beauté naturelle de cet écosystème, le lac Hassi Ben Abdallah est un endroit idéal pour se ressourcer et se connecter avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "eb88b5f6-e731-4513-822e-8e23cdbf326b", "translation" => "سواء كنتم تبحثون عن نزهة هادئة على ضفافها، أو نزهة عائلية لتناول الطعام في الهواء الطلق، أو مجرد الاستمتاع بجمال هذا النظام البيئي، يعتبر بحيرة حاسي بن عبد الله مكانًا مثاليًا للاسترخاء والتواصل مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //839
            ["id" => "8c7e24b3-47cb-4a3f-8dfc-b4fb94cfc39f", "translation" => "Bir Messaoud is a place steeped in history and economic development, named after its founder and its well, symbolizing the importance of water and natural resources in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b5f6aeb9-c26b-4843-a7db-073f2ee42b3f", "translation" => "Bir Messaoud est un lieu empreint d'histoire et de développement économique, qui tire son nom de son fondateur et de son puits, symbole de l'importance de l'eau et des ressources naturelles dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "54ff655b-3930-4ff8-b183-217806fbc754", "translation" => "بئر مسعود هو مكان محمل بالتاريخ والتطوير الاقتصادي، يأخذ اسمه من مؤسسه وبئره، ممثلاً أهمية المياه والموارد الطبيعية في", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //840
            ["id" => "877d31af-5902-4314-85b4-c91251044e3e", "translation" => "The archaeological site of Sedrata offers visitors a fascinating glimpse into the history of the region. It contains remnants of buildings, traces of daily life, and cultural elements that bear witness to the past prosperity of the city. It's a place where one can discover the traditions and achievements of this ancient society while appreciating the beauty of the surrounding desert landscape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9801b7ab-a5f1-43da-94d6-4ec597ee26d7", "translation" => "Le site archéologique de Sedrata offre aux visiteurs un aperçu fascinant de l'histoire de la région. On peut y trouver des vestiges de bâtiments, des traces de vie quotidienne et des éléments culturels qui témoignent de la prospérité passée de la ville. C'est un lieu où l'on peut découvrir les traditions et les réalisations de cette ancienne société, tout en appréciant la beauté du paysage désertique environnant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "55d078d2-82aa-4443-9186-170bf5b97583", "translation" => "مدينة سدراتة الأثرية تقدم للزوار نظرة مثيرة على تاريخ المنطقة. يحتوي على آثار مبانٍ قديمة وآثار من حياة اليومية وعناصر ثقافية تشهد على ازدهار المدينة في الماضي. إنه مكان يمكن للزائرين اكتشاف تقاليد وإنجازات هذه المجتمع القديم بينما يستمتعون بجمال المناظر الصحراوية المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //841
            ["id" => "2e186a7e-235e-4c96-b970-3804d561a30d", "translation" => "The Citroën stele bears witness to the boldness and achievement realized during this pioneering expedition, while celebrating the meeting of two civilizations through this ambitious journey across the desert. It is a symbol of technological progress and human adventure, leaving a lasting mark in the history of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "167ccc04-eb4e-4a7b-9bed-d7b9afd1fb00", "translation" => "La stèle Citroën témoigne de l'audace et de l'exploit réalisés lors de cette expédition pionnière, tout en célébrant la rencontre de deux civilisations à travers cet ambitieux voyage à travers le désert. C'est un symbole du progrès technologique et de l'aventure humaine, laissant une empreinte durable dans l'histoire de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ab8ab4d5-3476-4533-ba21-73aa8c28842e", "translation" => "يشهد معلم سيتروين على الجرأة والإنجاز الذي تم تحقيقه خلال هذه الرحلة الرائدة، بينما تحتفل بلقاء حضارتين من خلال هذه الرحلة الطموحة عبر الصحراء. إنها رمز للتقدم التكنولوجي والمغامرة البشرية، مما يترك أثراً دائماً في تاريخ المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //842
            ["id" => "3d54856b-0b73-4a43-948d-b20b38c39206", "translation" => "The freedom square is a symbol of the identity of the city of Touggourt. It reflects the dynamic and vibrant spirit of the local community, while also serving as a central place where various aspects of daily life intersect.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c804b8fa-6bfa-4eb3-8cf9-795df2be6c35", "translation" => "La place de la liberté est un symbole de l'identité de la ville de Touggourt. Elle reflète l'esprit dynamique et vivant de la communauté locale, tout en étant un lieu central où se croisent les différentes facettes de la vie quotidienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "41764e15-81be-49b7-a78a-221dddbc3a15", "translation" => "ساحة الحرية هي رمز لهوية مدينة تقرت. إنها تعكس الروح الدينامية والحية للمجتمع المحلي، بينما تعتبر مكانًا مركزيًا حيث تتقاطع مختلف جوانب الحياة اليومية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //843
            ["id" => "18c739fd-f354-4432-b375-7a635c8ae8db", "translation" => "The El Mourabitine garden is a true green gem in Touggourt, offering an oasis of tranquility and freshness in the midst of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "115c538d-85b2-43be-85b9-6931ade8784c", "translation" => "Le jardin el Mourabitine est un véritable joyau vert à Touggourt, offrant une oasis de tranquillité et de fraîcheur au milieu de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d3ca1006-4981-4198-b35b-b9e9412edc4d", "translation" => "حديقة المرابطين هي جوهرة خضراء حقيقية في تقرت، تقدم واحة من الهدوء والنضارة في وسط المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //844
            ["id" => "b832f450-4162-40cb-9be8-26cfc2032bbc", "translation" => "Despite its advanced state of decay, Ksar Mestaoua still holds undeniable historical value and cultural significance. Its preservation and restoration are essential to safeguard the architectural heritage and history of the Touggourt region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ef9e8ba8-7fe9-4dca-800b-05a280d9e97e", "translation" => "Malgré son état de dégradation avancé, le Ksar Mestaoua conserve une valeur historique et une importance culturelle indéniables. Sa préservation et sa restauration sont essentielles pour préserver le patrimoine architectural et l'histoire de la région de Touggourt.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4dd79126-5966-4c5b-a27e-230e4fd042d6", "translation" => "على الرغم من حالته المتقدمة من التدهور، يحتفظ قصر مستاوة بقيمة تاريخية وأهمية ثقافية لا تُنكر. الحفاظ عليه واستعادته ضروريان للحفاظ على التراث المعماري وتاريخ منطقة تقرت.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //845
            ["id" => "a6883afc-3fbd-4d9e-8a41-2f7404f015b6", "translation" => "The Messaoudi Park is a beloved destination for both Touggourt's residents and tourists, providing a fun and entertaining experience for the entire family. Whether it's for a leisurely day out, a group outing, or a special celebration, this amusement park is a must-visit place to enjoy delightful and memorable moments.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8b0ce0ac-3d7c-4e45-b67e-a28db6fc6b09", "translation" => "Le Messaoudi Park est un lieu apprécié des habitants et des touristes de Touggourt, offrant une expérience amusante et divertissante pour toute la famille. Que ce soit pour une journée de loisirs, une sortie en groupe ou une célébration spéciale, ce parc d'attractions est un endroit incontournable pour profiter de moments agréables et mémorables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8a71600f-38e5-491a-9de9-09314c94d1ee", "translation" => "حديقة مسعودي هي وجهة محبوبة للسكان المحليين والسياح في تقرت، حيث توفر تجربة ممتعة ومسلية لكافة العائلة. سواء كان الأمر يتعلق بقضاء يوم استجمام، أو رحلة جماعية، أو احتفال خاص، فإن هذه الحديقة الترفيهية هي مكان يجب زيارته للاستمتاع بلحظات سعيدة وذكريات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //846
            ["id" => "315f7502-0927-4dd4-ad4e-5f916f4395a8", "translation" => "The Temacine lake is a true natural gem, providing visitors with an ideal setting to relax, take a stroll, and admire the splendor of nature. It's an iconic place that bears witness to the richness and diversity of the region's landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a9e19fda-46d7-4718-93e2-1c9108d6104d", "translation" => "Le lac de Temacine est un véritable joyau naturel, offrant aux visiteurs un cadre idéal pour se détendre, se promener et admirer la splendeur de la nature. C'est un lieu emblématique qui témoigne de la richesse et de la diversité des paysages de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "55724b17-99fe-4d68-9e70-2bd9976b8063", "translation" => "بحيرة تماسين هي جوهرة طبيعية حقيقية، تقدم للزوار إطارًا مثاليًا للاسترخاء والتجول والتمتع بعظمة الطبيعة. إنها مكان رمزي يشهد على ثراء وتنوع المناظر الطبيعية في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //847
            ["id" => "be5738b7-a91e-4d8f-bfa6-559f29005c82", "translation" => "The old ksar of Temacine is an ancient archaeological site that bears witness to the rich history of this region, which has hosted various tribes. Despite its state of decay, its ruins are there to narrate the authenticity of the Oued-Righ civilization.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2dec5676-77b4-4100-8552-eb62542bd98b", "translation" => "Le vieux ksar de Temacine est un site archéologique ancien qui témoigne de l'histoire riche de cette région ayant accueilli différentes tribus. Malgré son état de dégradation, ses ruines sont là pour raconter l'authenticité de la civilisation d'Oued-Righ.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "de49d7c2-25dc-43c5-bda2-2bc1f7bc1a5a", "translation" => "القصر القديم في تماسين هو موقع أثري قديم يشهد على تاريخ غني لهذه المنطقة التي استضافت مجموعات قبلية متنوعة. على الرغم من حالته المتداعية، إلا أن أطلاله موجودة هنا لتروي أصالة حضارة وادي ريغ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //848
            ["id" => "b763efaa-12eb-4cff-9278-b6368b215255", "translation" => "Families in Touggourt consider this lake as a sanctuary, a gathering place where joy and conviviality prevail. Tourists are invited to come and discover the treasures of traditional craftsmanship.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b9476eea-de65-483c-82a5-fa6f6eb760f2", "translation" => "Les familles de Touggourt considèrent ce lac comme un sanctuaire, un lieu de retrouvailles où règnent la joie et la convivialité. Les touristes sont invités à venir découvrir les trésors de l'industrie artisanale traditionnelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7b766adb-f3a4-476d-b3eb-8e9101716d17", "translation" => "العائلات في تقرت تعتبر هذه البحيرة مأوىًا، مكانًا للالتقاء حيث تسود الفرحة والمرح. السياح مدعوون لزيارة واكتشاف كنوز الحرف اليدوية التقليدية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //849
            ["id" => "8864091c-f88b-47e8-887b-62b5fbfcec57", "translation" => "As a major spiritual center, the zaouia welcomes disciples and visitors from all around the world to reflect, study, and practice the teachings of the tariqa Tijaniya. It serves as a pilgrimage and gathering place for the faithful who seek spiritual guidance and inner peace.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1a9e4697-966b-4d72-928c-c5692927bfdb", "translation" => "En tant que centre spirituel majeur, la zaouïa accueille des disciples et des visiteurs venus des quatre coins du monde pour se recueillir, étudier et pratiquer les enseignements de la tariqa Tidjania. Elle constitue un lieu de pèlerinage et de rassemblement pour les fidèles qui viennent chercher la guidance spirituelle et la paix intérieure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "01e71625-5124-41b7-a66c-a395ab3fb723", "translation" => "بصفتها مركزًا روحيًا رئيسيًا، تستقبل الزاوية تلاميذًا وزوارًا قادمين من جميع أنحاء العالم للتفكير والدراسة وممارسة تعاليم الطريقة التجانية. إنها مكان تجمع للمؤمنين الذين يبحثون عن الهداية الروحية والسلام الداخلي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //850
            ["id" => "1e2fea05-3dfe-485d-8377-415e35fbc94a", "translation" => "In recognition of its historical significance, Ksar Rannou was listed in the supplementary inventory for classification as a historical monument by the Ministry of Culture in 2009. It provides visitors with an opportunity to discover this unique architectural heritage and delve into the history and culture of the Touggourt region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "49f883a6-fa6d-413e-96bf-816aac8d26f6", "translation" => "En reconnaissance de son importance historique, Ksar Rannou a été inscrit à l'inventaire supplémentaire en vue de son classement en tant que monument historique par le Ministère de la Culture en 2009. Il offre aux visiteurs une occasion de découvrir cet héritage architectural unique et de plonger dans l'histoire et la culture de la région de Touggourt.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "afb0830c-b273-487c-9bb8-9d0954b5b9df", "translation" => "تم تسجيل قصر رانو في القائمة الإضافية تقديرًا لأهميته التاريخية، بهدف تصنيفه كمعلم تاريخي من قبل وزارة الثقافة في عام 2009. يقدم للزوار فرصة لاكتشاف هذا التراث المعماري الفريد والانغماس في تاريخ وثقافة منطقة تقرت.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //851
            ["id" => "34e27732-08e3-4b4a-9336-0999acc9b44d", "translation" => "Ksar el Hadjira is a must-visit destination for history, architecture, and picturesque landscape enthusiasts. Whether for its historical significance, authentic atmosphere, or panoramic views, this ksar provides an enriching and memorable experience for visitors seeking cultural discoveries and natural beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a971baee-2417-42b4-a57c-d615bf0b9d58", "translation" => "Ksar el Hadjira constitue un lieu de visite incontournable pour les amateurs d'histoire, d'architecture et de paysages pittoresques. Que ce soit pour sa valeur historique, son ambiance authentique ou sa vue panoramique, ce ksar offre une expérience enrichissante et mémorable aux visiteurs en quête de découvertes culturelles et de beauté naturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c7149d16-27ef-4721-b7fe-458c97299d07", "translation" => "قصر الحجيرة هو وجهة لا غنى عنها لعشاق التاريخ والعمارة والمناظر الطبيعية الخلابة. سواء كان السبب هو قيمته التاريخية أو جوهره الأصيل أو مناظره البانورامية، يقدم هذا القصر تجربة غنية ولا تُنسى للزوار الذين يبحثون عن اكتشافات ثقافية وجمال طبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //852
            ["id" => "0b2fd5c3-d425-4fc3-baed-fdbc55034701", "translation" => "Whether for local residents looking to connect with their national history or for visitors from outside, the mujahid museum of Touggourt provides a unique opportunity to delve into the history of Algeria and pay tribute to the heroes who contributed to the country's liberation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d1afde49-735d-49cb-bb8f-1215d856a41c", "translation" => "Que ce soit pour les habitants locaux désireux de se connecter avec leur histoire nationale ou pour les visiteurs venus de l'extérieur, le musée du Moudjahid de Touggourt offre une occasion unique de plonger dans l'histoire de l'Algérie et de rendre hommage aux héros qui ont contribué à la libération du pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3eb37a57-b681-45b1-8743-9fa61f4244e2", "translation" => "سواء كان الأمر يتعلق بالسكان المحليين الذين يتطلعون للاتصال بتاريخ بلادهم الوطني أو بالزوار القادمين من الخارج، يقدم متحف المجاهد في تقرت فرصة فريدة للانغماس في تاريخ الجزائر وتقديم العرفان للأبطال الذين ساهموا في تحرير البلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //853
            ["id" => "cddd8b25-0d55-43de-b34b-22c8806f539d", "translation" => "The museum provides an immersive experience for visitors, immersing them in the era of the liberation war. Through carefully curated exhibitions and artifacts, it retraces the historical events, sacrifices, and efforts of the fighters for Algeria's independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c48f6709-8fd1-4750-a991-42fe038a52e7", "translation" => "Le musée offre une expérience immersive aux visiteurs, les plongeant dans l'époque de la guerre de libération. À travers des expositions et des artefacts soigneusement sélectionnés, il retrace les événements historiques, les sacrifices et les efforts des combattants pour l'indépendance de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d88e8913-ea8d-4f78-89cd-d95355c0d442", "translation" => "يقدم المتحف تجربة غامرة للزوار، حيث يغمرهم في فترة حرب التحرير. من خلال معارض وقطع أثرية مختارة بعناية، يتتبع المتحف الأحداث التاريخية والتضحيات وجهود المقاتلين من أجل استقلال الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //854
            ["id" => "265b5213-d52d-4f2c-ad44-8e21f74a1ea6", "translation" => "This museum offers visitors an immersion into the history and cultural richness of the Ahaggar, highlighting the traditions, art, craftsmanship, archaeology, and daily life of the communities that have been living there for centuries.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "17edf35f-a876-4a59-bf98-4303d06ca4e5", "translation" => "Ce musée offre aux visiteurs une immersion dans l'histoire et la richesse culturelle de l'Ahaggar, mettant en valeur les traditions, l'art, l'artisanat, l'archéologie et la vie quotidienne des communautés qui y vivent depuis des siècles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "188aa2a9-b4c5-4046-b747-d0209d34c53c", "translation" => "يقدم هذا المتحف للزوار غمرًا في تاريخ وثراء ثقافة الأهقار، مسلطًا الضوء على التقاليد والفنون والحرف اليدوية وعلم الآثار والحياة اليومية للجماعات التي تعيش هناك منذ قرون.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //855
            ["id" => "06b5b4a7-8bb7-4436-9e61-28c4e43a42bb", "translation" => "The Charles de Foucault fort embodies a place filled with memories and encounters, where history and spirituality intertwine. Visitors can immerse themselves in this unique atmosphere and explore the testimonies of that era through photographs and narratives that have survived in the archives, providing a unique insight into the life and exchanges between different cultures.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2692f561-2e4b-4642-96af-d346d5c5fd6b", "translation" => "Le fort du père Foucauld incarne ainsi un lieu chargé de souvenirs et de rencontres, où l'histoire et la spiritualité se mêlent. Les visiteurs peuvent se plonger dans cette atmosphère particulière et découvrir les témoignages de cette époque grâce aux photographies et aux récits qui ont survécu dans les archives, offrant un aperçu unique de la vie et des échanges entre différentes cultures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1d0da2b3-266e-49af-bf53-f3c910f8dcc2", "translation" => "حصن شارل دو فوكو هو مكان يتحلى بذكريات ولقاءات، حيث تتداخل التاريخ والروحانية. يمكن للزوار أن يغمروا أنفسهم في هذه الأجواء الفريدة ويستكشفوا شهادات تلك الحقبة من خلال الصور والسرد التي نجت في الأرشيف، مما يقدم لمحة فريدة عن الحياة والتبادلات بين مختلف الثقافات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //856
            ["id" => "767ceeb4-367f-4fa2-85d7-4b597ed54e15", "translation" => "'Iharen' means 'the pestle' in Berber. Its distinctive shape and strategic position make it an iconic landmark of the region. Visitors can admire its natural beauty and enjoy panoramic views of the surrounding desert landscape from its summits.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4aeba854-eb97-46df-921e-4e8f6a899a53", "translation" => "Iharen, signifie 'le pilon' en berbère. Sa forme distinctive et sa position stratégique en font un repère emblématique de la région. Les visiteurs peuvent admirer sa beauté naturelle et profiter de la vue panoramique sur le paysage désertique environnant depuis ses sommets.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0dac4b6d-3c28-42fa-aeb3-62c61772e6ea", "translation" => "ايهارن تعني 'المدقة' باللغة الأمازيغية. شكلها المميز وموقعها الاستراتيجي يجعلها علامة معروفة في المنطقة. يمكن للزوار أن يعجبوا بجمالها الطبيعي ويستمتعوا بإطلالات بانورامية على المناظر الصحراوية المحيطة من قممها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //857
            ["id" => "5d1e6408-9b07-4356-8931-d03859cae1da", "translation" => "The Ahaggar national park is a true natural gem, providing visitors with a unique experience in the heart of the Algerian desert. It serves as a sanctuary for biodiversity and promotes cultural heritage, making it an essential destination for nature lovers and adventurers seeking authentic discoveries.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fed1aea9-9da7-469b-9e47-b8412f785733", "translation" => "Le parc national de l'Ahaggar est un véritable joyau de la nature, offrant aux visiteurs une expérience unique au cœur du désert algérien. C'est un lieu de préservation de la biodiversité et de promotion du patrimoine culturel, faisant de lui une destination incontournable pour les amoureux de la nature et les aventuriers en quête de découvertes authentiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f8a091c2-a4b2-4935-847a-c26de63165de", "translation" => "الحظيرة الوطنية الأهڨار جوهرة طبيعية حقيقية، تقدم للزوار تجربة فريدة في قلب الصحراء الجزائرية. إنه مكان للحفاظ على التنوع البيولوجي وتعزيز التراث الثقافي، مما يجعله وجهة أساسية لعشاق الطبيعة والمغامرين الذين يبحثون عن اكتشافات أصيلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //858
            ["id" => "37209304-ebec-4262-adfb-89fa6b285c32", "translation" => "Father Charles de Foucauld's hermitage is an iconic monument located on the Assekrem plateau. This monastery was built in 1910 by the French monk himself, who lived there for a portion of his life. This hermitage houses the writings and manuscripts of Father de Foucauld, including a dictionary covering oral culture and memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3dcc614c-0917-426e-a006-5a53a2acfc50", "translation" => "L'ermitage du père Charles de Foucauld est un monument emblématique situé sur l'Assekrem. Ce monastère a été construit en 1910 par le moine français lui-même, qui y a vécu une partie de sa vie. Cet ermitage abrite les écrits et les manuscrits du père de Foucauld, y compris un dictionnaire portant sur la culture orale et les mémoires.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0621a291-77b8-4847-8f29-4caa501cc117", "translation" => "الصومعة الخاصة بالأب شارل دو فوكو هي منارة رمزية تقع على سهول أسكرام. تم بناء هذا الدير في عام 1910 من قبل الراهب الفرنسي نفسه، الذي عاش فيه جزءًا من حياته. تحتوي هذه الصومعة على كتابات ومخطوطات الأب دو فوكو، بما في ذلك قاموس يتعامل مع الثقافة الشفهية والذكريات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //859
            ["id" => "c881c14a-3794-40d4-b2fd-1fc513ebc59e", "translation" => "Gueltet Afilal is an exceptional site characterized by small terraces, pools, and waterfalls where water constantly springs forth. This phenomenon is unique in the region and creates a striking contrast with the arid environment that surrounds it.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c2830202-9c5a-4383-8887-108c111e991f", "translation" => "Gueltet Afilal est un site exceptionnel caractérisé par de petites terrasses, des mares et des cascades où l'eau jaillit en permanence. Ce phénomène est unique dans la région et crée un contraste saisissant avec l'environnement aride qui l'entoure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fc706f2f-6f79-49e4-a4fe-f66f0dc817bc", "translation" => "قلتة أفيلال موقع استثنائي يتميز بالبرك والشلالات حيث ينبع الماء باستمرار. هذه الظاهرة فريدة في المنطقة وتخلق تباينًا بارزًا مع البيئة الجافة المحيطة بها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //860
            ["id" => "53c85179-f3d2-443e-a437-fcb5135951ab", "translation" => "Whether it's to admire the beauty of the waterfalls, explore the surrounding trails, or simply relax to the soothing sound of flowing water, the Tamekrest waterfalls offer an unforgettable experience in Tamanrasset.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ae1c8ea3-8691-4f15-8a81-15dd08f15372", "translation" => "Que ce soit pour admirer la beauté des cascades, explorer les sentiers environnants ou simplement se détendre au son apaisant de l'eau qui s'écoule, les chutes de Tamekrest sont une expérience inoubliable à Tamanrasset.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "388a3abc-53d9-40b1-a23e-736f74486def", "translation" => "سواء كان الغرض من الزيارة هو الاستمتاع بجمال الشلالات، استكشاف المسارات المحيطة، أو ببساطة الاسترخاء تحت صوت المياه المتدفقة بلطف، فإن شلالات تمكرست تمثل تجربة لا تُنسى في تمنراست.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //861
            ["id" => "fe2cb50d-a85c-4b5a-9c77-eba3933ef45e", "translation" => "The tomb of Tin Hinan is a monument of significant historical and cultural importance. It embodies the influence of various Mediterranean, Saharan, and Sudanese cultures.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aa2de3d1-fe28-4b93-ba9d-300d71209d08", "translation" => "Le tombeau de Tin Hinan est un monument d'une grande importance historique et culturelle. Il incarne l'influence des différentes cultures méditerranéennes, sahariennes et soudanaises.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "76333bc2-7e39-40c7-9ebc-1dd175ccab81", "translation" => "ضريح تينهنان هو نصب ذو أهمية تاريخية وثقافية كبيرة. إنه يجسد تأثير مختلف الثقافات البحر الأبيض المتوسط والصحراوية والسودانية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //862
            ["id" => "a125031e-1b2d-4a39-a1e1-1dcefb5e32c1", "translation" => "The Tamanrasset house of culture plays a central role in the city's cultural life, providing a space for creativity, sharing, and artistic discovery for all art and culture enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "74e01d98-1039-4cb8-a40c-ad389e9ee6fd", "translation" => "La maison de la culture de Tamanrasset joue un rôle central dans la vie culturelle de la ville, offrant un espace de créativité, de partage et de découverte artistique pour tous les passionnés d'art et de culture.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f2e9542c-36c4-4d47-8721-06af3b9d55c7", "translation" => "دار الثقافة في تمنراست يلعب دورًا مركزيًا في الحياة الثقافية للمدينة، حيث يوفر مساحة للإبداع والمشاركة واكتشاف الفن لجميع عشاق الفن والثقافة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //863
            ["id" => "6e1f17e4-98b3-4cfb-bc38-b30ac7db9765", "translation" => "The reconciliation garden provides a green and tranquil space where people can reconnect with nature, relax, stroll, and enjoy outdoor leisure moments.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6c5181dd-4801-455a-af15-853864cada6c", "translation" => "Le Jardin de la réconciliation offre un espace de verdure et de tranquillité où les gens peuvent se reconnecter avec la nature, se détendre, se promener et profiter de moments de loisirs en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c26b17b2-1d32-4b80-aa67-db56a0ab6bfb", "translation" => "حديقة المصالحة توفر مساحة خضراء وهادئة حيث يمكن للأشخاص بالاتصال بالطبيعة، والاسترخاء، والتجول، والاستمتاع بأوقات الفراغ في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //864
            ["id" => "82771472-baa6-4e7d-a89a-68360ceb172d", "translation" => "The traditional crafts chamber in El Bayadh serves as a meeting place for artisans, craft enthusiasts, and tourists interested in the local culture and traditions.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2b5693e0-93ac-446b-905e-766f62fa9c23", "translation" => "La chambre de l'artisanat traditionnel d'El Bayadh constitue un lieu de rencontre entre les artisans, les amateurs d'artisanat et les touristes intéressés par la culture et les traditions locales.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "71a2bddd-4f4b-4c0e-93e0-19acb8b568c0", "translation" => "غرفة الصناعات اليدوية التقليدية في البيض تشكل مكاناً للاجتماع بين الحرفيين وعشاق الحرف والسياح الذين يهتمون بالثقافة والتقاليد المحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //865
            ["id" => "f73df07d-47ff-4352-a335-f3f6a2497c63", "translation" => "Thanks to its role in the cultural life of El Bayadh, the house of culture contributes to enriching the cultural fabric of the region by providing opportunities for artistic expression, entertainment, and education for all members of the community.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "841d5e51-185f-4a27-bae7-d2c75540ee37", "translation" => "Grâce à son rôle dans la vie culturelle d'El Bayadh, la maison de la culture contribue à enrichir le tissu culturel de la région en offrant des opportunités d'expression artistique, de divertissement et d'éducation pour tous les membres de la communauté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a5ce8b13-73dd-495f-aabe-790dc09be235", "translation" => "بفضل دورها في الحياة الثقافية للبيض، تساهم دار الثقافة في إثراء النسيج الثقافي للمنطقة من خلال توفير فرص للتعبير الفني والترفيه والتعليم لجميع أفراد المجتمع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //866
            ["id" => "340ff073-1de8-481a-835e-7cf36bcdb582", "translation" => "The ksar of Bent el Khas is a testament to the defensive architecture of its time, embodying the military history of the region. Its strategic position on the hill allowed it to oversee the surroundings and protect against attacks. Today, this architectural ensemble serves as a site of historical and cultural interest, attracting visitors who wish to explore the history and architecture of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4b78c0ad-ed42-45be-9899-6dc39eddaab6", "translation" => "Le ksar de Bent el Khas est un témoignage de l'architecture défensive de l'époque, et il incarne l'histoire militaire de la région. Sa position stratégique sur la colline lui permettait de surveiller les environs et de se protéger des attaques. Aujourd'hui, cet ensemble architectural constitue un site d'intérêt historique et culturel, attirant les visiteurs qui souhaitent découvrir l'histoire et l'architecture de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5b59ddf0-1b96-4327-86f0-2a328452eeae", "translation" => "قصر بنت الخص هو عبارة عن شهادة على الهندسة الدفاعية لعصره، ويجسد التاريخ العسكري للمنطقة. موقعه الاستراتيجي على التلة سمح له بمراقبة المحيط وحماية نفسه من الهجمات. اليوم، يُعتبر هذا التجمع المعماري موقعًا ذو أهمية تاريخية وثقافية، حيث يجذب الزوار الراغبين في استكشاف تاريخ وعمارة المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //867
            ["id" => "d0383e77-15af-4931-997d-5271c689ba23", "translation" => "Whether you're an amateur geologist or simply curious to explore Algeria's natural wonders, the El Gour site is a must-visit. You'll be amazed by the impressive rock formations and breathtaking landscapes as you delve into the fascinating geological history of this region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3ba192ee-7f78-43d0-a8fb-3ba27c7c6447", "translation" => "Que vous soyez un géologue amateur ou simplement curieux de découvrir les merveilles naturelles de l'Algérie, le site d'El Gour est un lieu incontournable. Vous serez émerveillé par les formations rocheuses impressionnantes et les paysages à couper le souffle, tandis que vous vous plongerez dans l'histoire géologique fascinante de cette région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b1c2139c-b95e-470e-a3d8-b75d853d0489", "translation" => "سواء كنت محبًا لعلم الجيولوجيا أو مجرد فضولي يرغب في اكتشاف عجائب الطبيعة في الجزائر، فإن موقع الڨورهو مكان لا بد من زيارته. ستندهش من التكوينات الصخرية المثيرة والمناظر الخلابة وأنت تغوص في التاريخ الجيولوجي الساحر لهذه المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //868
            ["id" => "9b2cf173-e1e5-4f8d-a3cb-f01110c6320b", "translation" => "The rock engravings of Brezina are a valuable testimony to prehistoric art and culture, despite the degradation the site has suffered over time. These ancestral engravings provide a fascinating glimpse into the life and beliefs of the ancient populations that once inhabited the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c1ead512-4913-400d-bd15-52b5784d0cd8", "translation" => "Les gravures rupestres de Brezina sont un témoignage précieux de l'art et de la culture préhistorique, malgré les dégradations que le site a subies au fil du temps. Ces gravures ancestrales offrent un aperçu fascinant de la vie et des croyances des populations anciennes qui ont habité la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4b2a1bc1-8bfe-4404-9175-3b8dee52196e", "translation" => "نقوش بريزينة الصخرية هي شهادة قيمة على فن وثقافة العصور القديمة، على الرغم من التدهور الذي تعرض له الموقع مع مرور الوقت. تقدم هذه النقوش القديمة نظرة مثيرة إلى حياة ومعتقدات السكان القدماء الذين عاشوا في تلك المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //869
            ["id" => "d40a850e-52cc-4b72-b434-c7d6990800cf", "translation" => "This engraving is a testament to Saharan Neolithic cave art, dating back to approximately 6000 BCE. It was created by the early inhabitants of the region, which is why the engraving site is named accordingly.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9c35d2bc-2bb7-4b36-a855-2eed758d9a5b", "translation" => "Cette gravure témoigne de l'art pariétal saharien du néolithique, remontant à environ 6000 ans avant J.C. Elle a été tracée par les premiers habitants de la région, d'où le nom donné à la station de gravures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "76c7350a-5e78-4479-a124-b405277eb5ce", "translation" => "هذه النقشة تشهد على فن الكهوف الصحراوية في العصر النيوليتي، يعود تاريخها إلى نحو 6000 سنة قبل الميلاد. تمثل هذه النقشة عملية قام بها سكان المنطقة في العصور القديمة، ومن هنا جاء اسم الموقع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //870
            ["id" => "30b6e301-7bd4-44f4-be9e-f2f4e1a6db52", "translation" => "Whether it's for a stroll, a rejuvenating break, or a family-friendly gathering, the el Wiam garden is the perfect place to momentarily escape the hustle and bustle of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aa7498b4-af84-4940-abde-786141552617", "translation" => "Que ce soit pour une promenade, une pause ressourçante ou un moment de convivialité en famille, le jardin el Wiam est l'endroit idéal pour échapper l’espace d’un instant au tumulte de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0e1ffd22-574d-49e5-9b0c-9aca4e8851ad", "translation" => "سواء كان الأمر يتعلق بالتجول، أو إجراء استراحة منشِّطة، أو قضاء وقت ممتع مع العائلة، حديقة الوئام هي المكان المثالي للاستمتاع بلحظة هدوء بعيدًا عن صخب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //871
            ["id" => "a8ea5e9f-a5c6-4c5b-b985-ff668575044a", "translation" => "Ksar Boussemghoun is a historical and culturally rich gem. Founded seven centuries ago by Cheikh Sidi Boussemghoun, this fortified village is steeped in the rich Berber tradition.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a5da1c99-c143-4b90-8803-6406e79e10ed", "translation" => "Ksar Boussemghoun est un joyau empreint d'histoire et de culture. Fondé il y a sept siècles par Cheikh Sidi Boussemghoun, ce village fortifié est imprégné de la riche tradition berbère.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a1c30356-6b76-4e77-9a75-de1fbaa4ae51", "translation" => "قصر بوسمغون هو جوهرة تاريخية وثقافية. تأسست هذه القرية المحصنة قبل سبعة قرون تقريبًا على يد الشيخ سيدي بوسمغون، وهو يمتلك تراثًا غنيًا في التقاليد الأمازيغية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //872
            ["id" => "b8d6e0c8-2ae5-4cc9-bbb0-8e4aba00b517", "translation" => "Explore the magnificent Ksar of Chellala, a must-visit destination for history and heritage enthusiasts. Located in the picturesque mountains of ksour, Chellala is home to two ancient ksours, Chellala Dahrania and Chellala Gueblia, offering an authentic experience in the heart of Algeria.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "45dd0a36-ea22-49d6-a186-c706e86936c4", "translation" => "Découvrez le magnifique ksar de Chellala, une destination incontournable pour les amateurs d'histoire et de patrimoine. Situé dans les pittoresques monts des ksour, Chellala abrite deux anciens ksours, Chellala Dahrania et Chellala Gueblia, offrant une expérience authentique au cœur de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ec745897-f914-4b57-b224-af229be2e69e", "translation" => "اكتشف قصر الشلالة الرائع، وجهة لا بد من زيارتها لعشاق التاريخ والتراث. يقع في جبال القصور الخلابة، تضم الشلالة قصرين قديمين، الشلالة الدهرانية والشلالة القبلية، مما يقدم تجربة أصيلة في قلب الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //873
            ["id" => "24f96173-ecfe-449f-a345-8afb2fd090f5", "translation" => "Krakda's Djebel el Melh is a natural treasure with exceptional mineral wealth that is sure to attract adventure and discovery seekers among visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5df95fc6-d78a-4662-9624-49272f5cb94b", "translation" => "Djebel el Melh de Krakda est un trésor naturel d'une richesse minérale exceptionnelle qui ne manquera pas d'attirer les visiteurs en quête d'aventure et de découverte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7eca1127-ee45-40cf-b7b0-6252c587cb94", "translation" => "جبل الملح في كراكدة هو كنز طبيعي غني بالمعادن استثنائي ومؤكد سيجذب الزوار الباحثين عن المغامرة والاكتشاف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //874
            ["id" => "1929deeb-a3dc-45d1-bfef-fa5e2170835d", "translation" => "Come and discover the Ksar of Arbaouat, a witness to a rich and fascinating history where various religious and cultural influences converge. Explore the remnants of this millennia-old ksar and immerse yourself in the unique atmosphere of this historically rich region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "07e21e18-7cbc-40a4-a9b3-ece3e72f32fb", "translation" => "Venez découvrir le Ksar d'Arbaouat, témoin d'une histoire riche et fascinante, où se mêlent différentes influences religieuses et culturelles. Explorez les vestiges de ce ksar millénaire et plongez dans l'atmosphère unique de cette région chargée d'histoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5278e782-3158-4e81-b55a-39a0b54aff10", "translation" => "تعال واكتشف قصر أربوات، شاهد على تاريخ غني ومثير، حيث تتداخل مختلف التأثيرات الدينية والثقافية. استكشف آثار هذا القصر الذي يعود تاريخه إلى أكثر من ألف سنة وانغمس في الأجواء الفريدة لهذه المنطقة الغنية بالتاريخ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //875
            ["id" => "6d928990-e1d1-44ac-8c38-aa5ea271efa4", "translation" => "Whether you're a history enthusiast, an architecture aficionado, or simply seeking a picturesque getaway, Ksar d'El Ghassoul is the perfect place for a enriching and immersive experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f5a2eb4e-37b6-4fab-8b12-03bbaf5eb96f", "translation" => "Que vous soyez passionné d'histoire, d'architecture ou simplement à la recherche d'une escapade pittoresque, Ksar d'El Ghassoul est l'endroit idéal pour une expérience enrichissante et immersive.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "489c0603-40ce-4541-81d8-069f2cedd937", "translation" => "سواء كنت عاشقًا للتاريخ أو عاشقًا للعمارة، أو ببساطة تبحث عن رحلة خلابة، فقصر الغاسول هو المكان المثالي لتجربة غنية ومشبعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //876
            ["id" => "c6651a52-3161-4a56-acc8-cfad57a16581", "translation" => "Explore Ksar Stitten and delve into the fascinating history of this region. Immerse yourself in the cultural richness and diversity of the peoples who have lived there, while admiring the traditional architecture and discovering the unique connections between different families.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "64c77915-f460-4f03-b454-1db37b2ac5d8", "translation" => "Explorez Ksar Stitten et plongez dans l'histoire fascinante de cette région. Imprégnez-vous de la richesse culturelle et de la diversité des peuples qui y ont vécu, tout en admirant l'architecture traditionnelle et en découvrant les liens uniques entre les différentes familles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c183d048-8be9-41e5-bfab-082f6a394ab6", "translation" => "استكشف قصر ستيتن وانغمس في تاريخ هذه المنطقة الرائع. امتزج بثقافتها الغنية وتنوع الشعوب التي عاشت فيها، واستمتع برؤية العمارة التقليدية واكتشاف الروابط الفريدة بين العائلات المختلفة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //877
            ["id" => "58655289-5179-4977-ba82-10c5c33fa890", "translation" => "Whether it's to admire the panoramic view from the dam, discover the bustling life of the surrounding palm grove, or simply relax by the water's edge, the Brezina dam offers a unique experience that blends nature, agriculture, and sustainable development.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "289f13dd-a2aa-4cf8-992b-cac4670455af", "translation" => "Que ce soit pour admirer la vue panoramique depuis le barrage, découvrir la vie foisonnante de la palmeraie environnante ou simplement se détendre au bord de l'eau, le barrage de Brezina offre une expérience unique, mêlant nature, agriculture et développement durable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1c9c76ff-f4da-427e-a0ba-32544198e153", "translation" => "سواء كان الهدف هو الاستمتاع بالمناظر البانورامية من السد، أو اكتشاف الحياة النابضة بالحيوية في مزرعة النخيل المحيطة، أو ببساطة الاسترخاء على ضفاف المياه، فإن سد بريزينة يقدم تجربة فريدة تمزج بين الطبيعة والزراعة والتنمية المستدامة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //878
            ["id" => "e77cdeb5-2137-4ca9-9c82-20805659b0e2", "translation" => "The ancient mosque of Abderrahmane ben Sakhr, dating back to the mid-19th century, is a historical marvel that is sure to captivate visitors. During your exploration of this historically rich mosque, you will be transported to the past and immersed in the cultural and spiritual richness of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f0508ef3-5dd7-4e51-aecf-89bf5fa7a973", "translation" => "La mosquée antique de Abderrahmane ben Sakhr, datant du milieu du 19e siècle, est une merveille historique qui ne manquera pas de captiver les visiteurs. Lors de votre exploration de cette mosquée chargée d'histoire, vous serez transporté dans le passé et immergé dans la richesse culturelle et spirituelle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "41759051-ffbb-4c24-86e8-4b7bbb90d1e3", "translation" => "مسجد عبد الرحمن بن صخر, الذي يعود تاريخه إلى منتصف القرن التاسع عشر، هو عجب تاريخي لا يمكن أن يفوت على الزوار. خلال استكشافك لهذا المسجد الغني بالتاريخ، ستنقل إلى الماضي وتتغمر في الثراء الثقافي والروحي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //879
            ["id" => "322f6d00-3119-4b40-9750-a6f23761e33e", "translation" => "The Amnir Tourath museum is a cultural treasure not to be missed during your visit to the region. This exceptional museum provides a captivating glimpse into the history, tradition, and cultural richness of Tindouf and its surroundings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "db07ff96-d587-43b8-9a4e-e09c46e2a830", "translation" => "Le musée Amnir Tourath est un trésor culturel à ne pas manquer lors de votre visite dans la région. Ce musée exceptionnel offre un aperçu captivant de l'histoire, de la tradition et de la richesse culturelle de Tindouf et de ses environs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8b5ac7df-e89c-4201-845f-3dfc0cddd8c0", "translation" => "متحف آمنير تراث هو كنز ثقافي يجب على الزوار عدم تفويته أثناء زيارتهم للمنطقة. يقدم هذا المتحف الاستثنائي نظرة جذابة إلى تاريخ وتقاليد وثراء ثقافي تندوف ومحيطها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //880
            ["id" => "2baabf09-2dcc-4ff5-9e7a-2805c8890b19", "translation" => "The Tindouf national park is a place dedicated to preserving both cultural and natural heritage, as well as serving as a meeting point between visitors and the local residents. It provides a unique opportunity to discover and appreciate the beauty, history, and cultural diversity of Tindouf.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9d52cfb6-64ea-4710-b003-bff209dbe1c3", "translation" => "Le parc national de Tindouf est un lieu de préservation du patrimoine culturel et naturel, ainsi qu'un lieu de rencontre entre les visiteurs et les habitants de la région. Il offre une occasion unique de découvrir et d'apprécier la beauté, l'histoire et la diversité culturelle de Tindouf.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9b92d7ea-0d1e-46c6-9b37-114a5c5da7ff", "translation" => "الحظيرة الوطنية لتندوف هو مكان مخصص للحفاظ على التراث الثقافي والطبيعي، بالإضافة إلى كونه مكانًا للالتقاء بين الزوار وسكان المنطقة. إنه فرصة فريدة لاكتشاف وتقدير جمال وتاريخ وتنوع ثقافي تندوف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //881
            ["id" => "ad176ad8-417e-4990-819f-dcbabeac4fd9", "translation" => "The Ouarkziz crater is an impressive natural site in the Djebel Ouarkziz region. It is a meteorite crater that was formed approximately 70 million years ago, during the Cretaceous period or more recently.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b068403b-fd50-45c8-b912-816ac414bb59", "translation" => "Le cratère d'Ouarkziz est un site naturel impressionnant dans la région du Djebel Ouarkziz. Il s'agit d'un cratère météoritique qui a été formé il y a environ 70 millions d'années, pendant la période du Crétacé ou plus récemment.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5e898d92-ff92-46dd-8942-ed80b8a01d4e", "translation" => "الفوهة النيزكية واركزيز هو موقع طبيعي مذهل في منطقة جبل واركزيز. إنها فوهة نيزكية تميز بتكوينها قبل نحو 70 مليون سنة، خلال الفترة الكريتاسية أو في وقت أقرب من ذلك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //882
            ["id" => "3400bed6-d67e-4857-8218-be697aadde18", "translation" => "The Djebel Aissa national park is a natural treasure to discover. By visiting this park, travelers will have the opportunity to connect with the wild beauty of the Saharan Atlas and contribute to the protection of this fragile ecosystem.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "02e663ce-6e25-488c-a1b3-2ef8021e827e", "translation" => "Le parc national de Djebel Aissa est un trésor naturel à découvrir. En visitant ce parc, les voyageurs auront l'occasion de se connecter avec la beauté sauvage de l'Atlas saharien et de contribuer à la protection de cet écosystème fragile.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "befb0aeb-926b-4c17-b266-a5ff7fea0796", "translation" => "الحظيرة الوطنية جبل عيسى كنز طبيعي يجب اكتشافه. من خلال زيارة هذه الحظيرة، سيكون لدى المسافرين الفرصة للاتصال بجمال الأطلس الصحراوي البري والمساهمة في حماية هذا النظام البيئي الهش.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //883
            ["id" => "6f405d40-96ef-461a-8354-994f82a86b18", "translation" => "The Ain Ouarka wetland, located in the Ksour mountains of the Saharan Atlas, is a geothermal wonder. This semi-circular geological cove is surrounded by steep mountains reaching an altitude of 1672 meters and houses both hot and cold springs.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "625c4441-b28f-4e7d-8428-1afd36ec17c1", "translation" => "La zone humide d'Ain Ouarka, située dans les monts des Ksour de l'Atlas saharien, est une merveille géothermique. Cette crique géologique semi-circulaire est entouré de montagnes abruptes atteignant une altitude de 1672 mètres, et abrite des sources chaudes et froides.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "02351f05-0616-416e-b5a9-3f67bdb62725", "translation" => "المنطقة الرطبة في عين ورقة، الموجودة في جبال القصور في الأطلس الصحراوي، هي عجبة جيولوجية. هذا المدرج الجيولوجي شبه الدائري محاط بجبال شاهقة تصل ارتفاعها إلى 1672 مترًا وتضم ينابيع ساخنة وباردة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //884
            ["id" => "8219a4a9-1347-4bcf-9d87-a8da79af8675", "translation" => "Let yourself be charmed by the beauty of nature, the local hospitality, and the soothing benefits of Ain Ouarka's thermal resort. Whether you're seeking a relaxing getaway or an outdoor adventure, this place will provide you with a true haven of peace amidst preserved natural beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "07e4dce5-58f6-4498-a54d-0fd2cb6f60c3", "translation" => "Laissez-vous séduire par les charmes de la nature, l'hospitalité locale et les bienfaits apaisants de la station thermale d'Ain Ouarka. Que vous soyez à la recherche d'une escapade de détente ou d'une expérience en plein air, cet endroit saura vous offrir un véritable havre de paix au milieu d'une beauté naturelle préservée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f51f4ee7-4bba-43d6-8649-21dd8aa80426", "translation" => "دع نفسك تتسحر بجمال الطبيعة، واستضافة المحليين، وفوائد الاسترخاء في منتجع عين ورقة. سواء كنتم تبحثون عن هروب للاسترخاء أو تجربة في الهواء الطلق، سيقدم لكم هذا المكان ملاذًا حقيقيًا للسلام في وسط جمال طبيعي محفوظ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //885
            ["id" => "d1871f78-1a33-47eb-853a-7f6c7b538deb", "translation" => "A journey to Ksar Samer is an immersion into the cultural and architectural heritage of the region, an experience that will allow you to connect with the past and appreciate the beauty of this historically rich place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "35a6e0ed-3cc2-4841-92ec-9d405e1b1a05", "translation" => "Un voyage à Ksar Samer est une immersion dans le patrimoine culturel et architectural de la région, une expérience qui vous permettra de vous connecter au passé et d'apprécier la beauté de ce lieu chargé d'histoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "94cc8cc4-24b2-4bc7-a2a6-2edeaec68a99", "translation" => "رحلة إلى قصر صامر هي غمر في التراث الثقافي والمعماري للمنطقة، تجربة تسمح لك بالاتصال بالماضي وتقدير جمال هذا المكان الذي يحمل تاريخًا غنيًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //886
            ["id" => "efe5f076-6589-4265-b9ef-bf92dc7e69ec", "translation" => "A visit to the Sheikh Bouamama museum is a unique opportunity to delve into the history of Algerian resistance and pay tribute to a man who played a crucial role in the quest for freedom of the Algerian people.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4672ccfb-4012-4b94-84b0-c1fa4153ba6b", "translation" => "Une visite au musée du cheikh Bouamama est une occasion unique de plonger dans l'histoire de la résistance algérienne et de rendre hommage à un homme qui a joué un rôle essentiel dans la quête de liberté du peuple algérien..", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f82e9c98-591d-475c-aab7-f80b4a23194a", "translation" => "زيارة إلى متحف الشيخ بوعمامة هي فرصة فريدة للغمر في تاريخ المقاومة الجزائرية ولتقديم الاحترام لرجل قام بدور حاسم في سعي الشعب الجزائري نحو الحرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //887
            ["id" => "2ffbedfb-2414-434b-9b80-ccb42cbcdefa", "translation" => "Visiting Ksar Sheikh Bouamama is a unique opportunity to delve into history, discover the legacy of resistance, and witness the resilience of the Algerian people. It is a site rich in symbolism and national pride, providing visitors with a memorable experience and a deeper understanding of the region's history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "53d565af-21c3-45d6-91e0-c6341ed6eede", "translation" => "La visite du Ksar cheikh Bouamama est une occasion unique de se plonger dans l'histoire, de découvrir l'héritage de la résistance et de témoigner de la résilience du peuple algérien. C'est un site chargé de symbolisme et de fierté nationale, offrant aux visiteurs une expérience mémorable et une meilleure compréhension de l'histoire de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2154458d-b75d-4771-b31d-e41fb2cd3de8", "translation" => "زيارة قصر الشيخ بوعمامة هي فرصة فريدة للانغماس في التاريخ، واكتشاف تراث المقاومة، وشهد على صمود الشعب الجزائري. إنه موقع غني بالرمزية والفخر الوطني، يقدم للزوار تجربة لا تُنسى وفهمًا أعمق لتاريخ المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //888
            ["id" => "6eaf5c0d-ee80-4998-8104-9bd9ec967f51", "translation" => "Ksar Moghrar is a valuable witness to local history and culture. By visiting this site, visitors can explore the traditional architecture of the time, wander through narrow streets, and feel the history-laden atmosphere of this place. It's a unique opportunity to immerse oneself in the past and appreciate the richness of the region's heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fdc83e89-edde-4d5f-9b80-703ee3625398", "translation" => "Ksar Moghrar est un témoin précieux de l'histoire et de la culture locales. En visitant ce site, les visiteurs peuvent découvrir l'architecture traditionnelle de l'époque, se promener dans les ruelles étroites, et ressentir l'atmosphère chargée d'histoire qui règne dans cet endroit. C'est une occasion unique de se plonger dans le passé et d'apprécier la richesse du patrimoine de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "946a3430-2741-4c11-80c4-c135fcf90831", "translation" => "قصر مغرار هو شاهد قيم على التاريخ والثقافة المحلية. من خلال زيارة هذا الموقع، يمكن للزوار استكشاف العمارة التقليدية في تلك الفترة، والتجول في الأزقة الضيقة، والشعور بالأجواء المشحونة بالتاريخ في هذا المكان. إنها فرصة فريدة للانغماس في الماضي وتقدير ثراء تراث المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //889
            ["id" => "789b61e9-bfb4-45b3-bc30-54a5a4dcdd1c", "translation" => "The rock engravings of Tiout are a prehistoric treasure of the region. These engravings are embedded in the rocks and testify to the art and culture of the ancient populations that inhabited the area thousands of years ago.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4a9c1d79-52e7-46e0-9789-2e4f80e11856", "translation" => "Les gravures rupestres de Tiout sont un trésor préhistorique de la région. Ces gravures sont incrustées dans les roches et témoignent de l'art et de la culture des populations anciennes qui y ont habité il y a des milliers d'années.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5572d6ec-a3ba-4976-b938-c17621195a70", "translation" => "نقوش تيوت الصخرية هي كنز ما قبل التاريخ في المنطقة. هذه النقوش محفورة في الصخور وتشهد على فن وثقافة السكان القدماء الذين عاشوا في المنطقة قبل آلاف السنين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //890
            ["id" => "d83aaca5-eaa9-4009-9beb-18ba33cd10fc", "translation" => "Whether you're passionate about history, nature, or simply seeking a relaxing getaway, the Tiout oasis is the perfect place to fulfill all your expectations. Get ready to experience unforgettable moments, rejuvenate, and create precious memories at the heart of this jewel of the Algerian desert.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4e3ad139-c005-4fc9-84e5-f7ba87ebe3d3", "translation" => "Que vous soyez passionné par l'histoire, la nature ou simplement à la recherche d'une escapade relaxante, l'oasis de Tiout est l'endroit idéal pour répondre à toutes vos attentes. Préparez-vous à vivre des moments inoubliables, à vous ressourcer et à créer des souvenirs précieux au cœur de ce joyau du désert algérien.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "85bf6084-801b-467b-b1f9-9a0e5e64ac2a", "translation" => "سواء كنت مهتمًا بالتاريخ أو الطبيعة أو مجرد البحث عن إجازة مريحة، فإن واحة تيوت هي المكان المثالي لتلبية جميع توقعاتك. قم بالاستعداد لتجربة لا تُنسى، وللتجديد، ولإنشاء ذكريات ثمينة في قلب هذه الجوهرة في الصحراء الجزائرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //891
            ["id" => "0e3fcd98-77e8-4fb9-808c-eb9d3f33d4b7", "translation" => "Immerse yourself in the captivating atmosphere of Ksar Tiout, explore its winding alleys, admire its traditional architecture, and soak in the history that unfolded there. A visit to this iconic place will transport you to another time, offering an unforgettable experience at the heart of Algerian culture and heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "17d61319-599f-4061-946e-83a3bdf85534", "translation" => "Plongez dans l'atmosphère captivante de Ksar Tiout, explorez ses ruelles sinueuses, admirez son architecture traditionnelle et imprégnez-vous de l'histoire qui s'y est déroulée. Une visite de ce lieu emblématique vous transportera dans un autre temps, vous offrant une expérience inoubliable au cœur de la culture et du patrimoine algériens.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5d351c2c-7db3-497b-8801-15552cf24c25", "translation" => "انغمس في الأجواء الرائعة لقصر تيوت، استكشف زقاقها المتعرجة، وأعجب بعمارتها التقليدية ستأخذك زيارة هذا المكان الرمزي في رحلة عبر الزمن، مقدمة لك تجربة لا تُنسى في قلب الثقافة والتراث الجزائري.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //892
            ["id" => "539e808f-19aa-41f8-88d9-b1a03cc8614e", "translation" => "Built in the 14th century AD, this stone and adobe ksar is a true architectural gem. It is covered with columns of willows, junipers, and palm trees, creating an atmosphere that is both majestic and peaceful.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2fd83d10-296d-459a-aa70-05ca56d86fac", "translation" => "Construit au XIVème siècle après J-C, ce ksar en pierre et en pisé est un véritable joyau architectural. Il est recouvert de colonnes de saules, de genévriers et de palmiers, créant une atmosphère à la fois majestueuse et paisible.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1a6da5d5-6366-464d-99af-31dad28e2cc9", "translation" => "تم بناؤه في القرن الرابع عشر الميلادي، هذا القصر الجزائري المصنوع من الحجر والطين الرملي هو جوهرة معمارية حقيقية. إنه مغطى بأعمدة من الصفصاف وأشجار العرعار والنخيل، مما يخلق أجواءً مهيبة وساحرة في الوقت نفسه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //893
            ["id" => "55b8752b-75a7-4cce-9ccc-1f0ece439be4", "translation" => "As a preferred destination for researchers and dinosaur enthusiasts, the Sfissifa dinosaur museum is a must-visit for anyone interested in these fascinating creatures. Whether you're a scientist, an enthusiast, or simply curious, let yourself be transported into the prehistoric world through this exceptional collection of fossils.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aecb958e-3ee4-4417-8c64-ec27032dbb9b", "translation" => "En tant que destination privilégiée des chercheurs et des amateurs de dinosaures, le musée du Dinosaure de Sfisifa constitue une étape incontournable pour quiconque s'intéresse à ces créatures fascinantes. Que vous soyez un scientifique, un passionné ou simplement curieux, laissez-vous transporter dans le monde préhistorique au travers de cette collection exceptionnelle de fossiles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7a38ed05-807f-413e-91d6-523556c62518", "translation" => "بوصفه وجهة مفضلة للباحثين وعشاق الديناصورات، يعتبر متحف الديناصورات في صفيصيفة محطة لا غنى عنها لأي شخص مهتم بتلك المخلوقات الرائعة. سواء كنت عالمًا، أو مهووسًا بالموضوع، أو مجرد فضولي، دع نفسك تنقل إلى عالم ما قبل التاريخ من خلال هذه المجموعة الاستثنائية من الحفاريات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //894
            ["id" => "ce04edd7-9189-46a9-998e-4ecac690c6e1", "translation" => "Whether you're passionate about history, art, or simply curious to learn more about the Tiout region, this museum offers you an enriching experience. Dive into the history and culture of this unique region by visiting this captivating place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0deee3d4-afca-4851-8a68-999cb1d01f8d", "translation" => "Que vous soyez passionné d'histoire, d'art ou simplement curieux d'en apprendre davantage sur la région de Tiout, ce musée vous offre une expérience enrichissante. Plongez dans l'histoire et la culture de cette région unique en visitant ce lieu captivant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bfa4db6a-87c7-4d34-b713-feb0692fd72c", "translation" => "سواء كنت مهتمًا بالتاريخ أو الفن أو مجرد فضولي لمعرفة المزيد عن منطقة تيوت، يقدم لك هذا المتحف تجربة غنية. اغمر نفسك في تاريخ وثقافة هذه المنطقة الفريدة من خلال زيارة هذا المكان المثير.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //895
            ["id" => "8d1a506c-f39d-4bfa-9bcb-a0df995705b9", "translation" => "Whether it's for a relaxing family day, a birthday party, or a school outing, the Ain Sefra park ensures moments of joy and fun for children. Come and enjoy exciting attractions and playful activities to create precious family memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9d41e9ce-5630-4ccd-833b-1a9d140fcb87", "translation" => "Que ce soit pour une journée de détente en famille, une fête d'anniversaire ou une sortie scolaire, le parc d'Ain Sefra garantit des moments de bonheur et d'amusement pour les enfants. Venez profiter des attractions excitantes et des activités ludiques pour créer des souvenirs précieux en famille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d7ffb381-b54e-4cb6-a914-be22e91af42c", "translation" => "سواء كان ذلك ليوم عائلي مريح، أو حفلة عيد ميلاد، أو رحلة مدرسية، تضمّ حديقة عين الصفراء لحظات من السعادة والمرح للأطفال. تعالوا واستمتعوا بالمعالم المثيرة والأنشطة الترفيهية لخلق ذكريات عائلية ثمينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //896
            ["id" => "156d5231-433f-4065-b5f6-88046d3a5f4b", "translation" => "Built in 1323 (723 AH), this mosque has endured the centuries and has undergone several renovations over time to preserve its beauty and authenticity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c60a19bb-cd3b-4538-bcbc-5821d08e2f2b", "translation" => "Construite en 1323 (723 AH), cette mosquée a traversé les siècles et a subi plusieurs restaurations au fil du temps pour préserver sa beauté et son authenticité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "297b291c-5b4c-4918-8d59-c2492d7eddca", "translation" => "بُني هذا المسجد في عام 1323 (723 هـ)، وقد عاش عبر العصور وخضع لعدة أعمال ترميم على مر الزمن للحفاظ على جماله وأصالته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //897
            ["id" => "c2612cae-82f5-48dc-b86b-118dca1cef69", "translation" => "Whether you're a nature enthusiast, a photography aficionado, or simply seeking tranquility, the Lehrahir waterfalls are a true natural treasure to explore. They provide a memorable experience in an exceptional natural setting, where flowing water creates a soothing symphony for all the senses.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0dda957b-bc12-42c1-b143-6194842119e1", "translation" => "Que vous soyez un amoureux de la nature, un adepte de la photographie ou simplement en quête de tranquillité, les chutes de Lehrahir sont un véritable trésor naturel à découvrir. Elles offrent une expérience mémorable dans un cadre naturel exceptionnel, où l'eau en mouvement crée une symphonie apaisante pour tous les sens.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cf2acd5a-f0f5-4333-ac31-3f6cf7d8aa3c", "translation" => "سواء كنت من عشّاق الطبيعة، أو من محبي التصوير الفوتوغرافي، أو ببساطة تبحث عن الهدوء، فإن شلالات لهراهير هي كنز طبيعي حقيقي يجب استكشافه. إنها توفر تجربة لا تُنسى في إطار طبيعي استثنائي، حيث تخلق مياهها الجارية سيمفونية منعشة لجميع الحواس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //898
            ["id" => "178f75b3-3069-451e-9344-99017407cf91", "translation" => "Built in 1885, this French internment camp during the colonial era housed opponents to Vichy, as well as Algerian and African nationalists. Omar Ouzegane, Chadli Mekki, Abdelmadjid Aouchiche were among those who experienced the hardships of imprisonment in this camp. ", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bd70fa44-f931-494e-a2ca-d43c0e746a97", "translation" => "Construit en 1885, ce camp d'internement français à l'époque coloniale où des opposants à Vichy, puis des nationalistes algériens et africains furent emprisonnés. Omar Ouzegane, Chadli Mekki, Abdelmadjid Aouchiche ont connu les affres de l'incarcération dans ce camp. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "69baf6d6-d3a0-440f-bed0-dcd40b590fda", "translation" => "بُني هذا المعسكر الفرنسي في عام 1885 خلال العصر الاستعماري، واحتضن فيه معارضين فيشي، بالإضافة إلى قوميين جزائريين و إفريقيين. عاش عمار أوزقان، شادلي مكي، عبد المجيد أوشيش وغيرهم الكثير من مرارات الاحتجاز في هذا المعسكر. ", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //899
            ["id" => "31a1f27f-626c-41a9-abff-c51b4ec6e437", "translation" => "The open-air theater of Adrar is a place where art, nature, and community come together to celebrate the beauty of artistic expression. It is a cultural cornerstone in the region, contributing to the enrichment and diversity of the local artistic scene.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "18abfc0b-5a47-4c7b-86c3-2e25f39a7e96", "translation" => "Le théâtre en plein air d'Adrar est un lieu où l'art, la nature et la communauté se rejoignent pour célébrer la beauté de l'expression artistique. Il est un pilier culturel dans la région, contribuant à l'enrichissement et à la diversité de la scène artistique locale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "eeec766e-e493-48a9-adee-2b5bf9cafce8", "translation" => "مسرح الهواء الطلق في أدرار هو مكان حيث يتلاقى الفن والطبيعة والمجتمع للاحتفال بجمال التعبير الفني. إنه ركيزة ثقافية في المنطقة، تسهم في إثراء وتنويع الساحة الفنية المحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //900
            ["id" => "268d7811-2699-4f6f-b4e9-564a627a8adb", "translation" => "The Bahda amusement park is a vibrant and entertaining place where visitors can enjoy a variety of attractions, games, and culinary delights. It's the perfect place to spend an unforgettable day filled with laughter and shared moments of joy.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e868f74a-761d-4d06-98e3-e754d12cd7b6", "translation" => "Le parc d'attractions Bahda est un lieu vibrant et divertissant où les visiteurs peuvent profiter d'une variété d'attractions, de jeux et de délices culinaires. C'est l'endroit parfait pour passer une journée inoubliable remplie de rires et de moments de joie partagée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d73de89f-64b1-46c0-b985-75d6842eac27", "translation" => "حديقة التسلية بهدة مكان ممتع حيث يمكن للزوار الاستمتاع بمجموعة متنوعة من الألعاب والمتع الطهي. إنها المكان المثالي لقضاء يوم لا يُنسى مليء بالضحك وأوقات فرح مشتركة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //901
            ["id" => "f30152ef-029f-4364-83f9-b5cfec82a4a9", "translation" => "The house of culture is a vibrant and versatile cultural center, providing dedicated spaces for art, music, theater, and intellectual thought. It is a place for meeting and exchange, fostering artistic development and the discovery of the cultural richness of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "383a4566-ea48-4a00-8751-800ca1915b45", "translation" => "La maison de la culture est un centre culturel animé et polyvalent, offrant des espaces dédiés à l'art, à la musique, au théâtre et à la pensée intellectuelle. C'est un lieu de rencontre et d'échange, favorisant l'épanouissement artistique et la découverte de la richesse culturelle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "63a89eb4-c560-4ec6-b759-3d8e75086f18", "translation" => "دار الثقافة هو مركز ثقافي حيوي ومتعدد الاستخدامات، يوفر مساحات مخصصة للفن، والموسيقى، والمسرح، والفكر الفلسفي. إنه مكان للالتقاء والتبادل، يعزز التنمية الفنية واكتشاف ثراء الثقافة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //902
            ["id" => "92701843-627c-444b-b919-253f1c5482a1", "translation" => "The mujahid museum of Adrar is an essential place of memory, reminding of the significance of the struggle for Algeria's independence and honoring the sacrifices of the mujahideen. It is a place that invites reflection on the history and values that have shaped the country while preserving and transmitting to future generations the narrative of this crucial period in Algeria's history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7dbc11e4-ad64-4f6d-9111-b81171a75563", "translation" => "Le musée du Moudjahid d'Adrar est un lieu de mémoire essentiel, rappelant l'importance de la lutte pour l'indépendance de l'Algérie et honorant les sacrifices des moudjahidine. C'est un endroit qui invite à la réflexion sur l'histoire et les valeurs qui ont façonné le pays, tout en préservant et en transmettant aux générations futures le récit de cette période cruciale de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bde50e2c-f7c2-46a6-894a-fce46497ff83", "translation" => "متحف المجاهد في أدرار هو مكان ذو أهمية كبيرة للذاكرة، يُذكّر بأهمية النضال من أجل استقلال الجزائر ويكرّم تضحيات المجاهدين. إنه مكان يدعو إلى التأمل في التاريخ والقيم التي صاغت البلاد، مع الحفاظ على نقل قصة هذه الفترة الحاسمة في تاريخ الجزائر إلى الأجيال القادمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //903
            ["id" => "3af7f62b-2dbe-4bcb-b81d-551ea6c2222a", "translation" => "The martyrs' square is an iconic place rich in history and symbolism. It is spacious and well-designed, providing an open space where visitors can walk and relax.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dd550e17-a1a8-4675-b048-068d60c3bae9", "translation" => "La place des Martyrs est un lieu emblématique chargé d'histoire et de symbolisme. Elle est spacieuse et bien aménagée, offrant un espace ouvert où les visiteurs peuvent se promener et se détendre.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "97cd67ba-6eef-4c7b-bc34-1c904c207378", "translation" => "ساحة الشهداء هي مكان رمزي غني بالتاريخ والرمزية. إنها واسعة ومصممة بشكل جيد، توفر مساحة مفتوحة حيث يمكن للزوار التجول والاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //904
            ["id" => "69200cdf-3086-4582-9fbd-003c460db626", "translation" => "Ksar Tamentit, built in the year 1146 AH, is considered the oldest ksar in Adrar. In the past, it served as the capital of central Touat, an important trade center, and a waypoint for caravans of merchants and travelers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dcd3e13f-79b3-459e-b227-d9ae0c3e966d", "translation" => "Ksar Tamentit, édifié en 1146 H, est considéré comme le plus ancien ksar d'Adrar. Autrefois, il était la capitale du Touât central, un important centre commercial et un lieu de passage pour les caravanes de marchands et de voyageurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c7ede4b4-9d90-42c9-8e83-74d563afffaf", "translation" => "قصر تامنطيت, الذي بني في عام 1146 هـ، يُعتبر أقدم قصر في أدرار. في الماضي، كان عاصمة التوات الوسطى ومركزًا تجاريًا مهمًا وموقعًا لعبور قوافل التجار والمسافرين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //905
            ["id" => "41bbd24d-3a13-46b4-a061-62e3d98c00d3", "translation" => "Whether you're a craft enthusiast, curious to explore the cultural richness of the region, or in search of unique pieces to take home, the traditional crafts center of Adrar is a must-visit destination during your stay in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dcc300ab-9367-4825-b0a7-c85cfeb6ee5d", "translation" => "Que vous soyez amateur d'artisanat, curieux de découvrir la richesse culturelle de la région ou à la recherche de pièces uniques à ramener chez vous, le centre de l'artisanat traditionnel d'Adrar est un lieu incontournable à visiter lors de votre séjour dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a09ae260-0b75-4432-a2bc-fa723a3c223b", "translation" => "سواء كنت عاشقًا للحرف اليدوية، أو كنت متشوقًا لاستكشاف الثراء الثقافي للمنطقة، أو كنت بحثًا عن قطع فريدة لاقتنائها، مركز الحرف اليدوية التقليدية في أدرار هو وجهة لا غنى عن زيارتها أثناء إقامتك في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //906
            ["id" => "38583627-739d-428e-880b-1d9b438d4b1d", "translation" => "Ksar Admer is a historically significant site in the region. Built during the 15th century, it is considered a remarkable example of traditional architecture from that time period.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "293cbe6b-d741-4ba5-88bd-d4720ad54efb", "translation" => "Ksar Admer est un site historique d'une grande importance dans la région. Construit au cours du XVe siècle, il est considéré comme un exemple remarquable de l'architecture traditionnelle de l'époque.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9acf1caf-8850-4e9f-a030-2a8400adaac6", "translation" => "قصر أدمر هو موقع تاريخي ذو أهمية كبيرة في المنطقة. تم بناؤه خلال القرن الخامس عشر ويُعتبر مثالًا ملحوظًا على الهندسة المعمارية التقليدية لتلك الفترة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //907
            ["id" => "869060ce-1d6b-4ea5-948c-a924bc2dc2d3", "translation" => "A favorite spot for hikers and photography enthusiasts, offering breathtaking panoramas of the lake and the surrounding desert landscapes. It's a place to relax, rejuvenate, and connect with nature in this peaceful setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c984b635-212a-43b2-983f-1fe7c021a565", "translation" => "Un endroit prisé des amateurs de randonnée et des passionnés de photographie, offrant des panoramas à couper le souffle sur le lac et les paysages désertiques environnants. On peut s'y détendre, se ressourcer et se connecter avec la nature dans ce cadre paisible.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "73e79a2d-c9cc-44af-99a7-a9dfa2e2044d", "translation" => "مكان مفضل لعشاق رياضة المشي وعشاق التصوير، حيث يوفر مناظر خلّابة للبحيرة والمناظر الصحراوية المحيطة. إنه مكان للاسترخاء والتجديد والاتصال مع الطبيعة في هذا الإعداد الهادئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //908
            ["id" => "1980c8b6-6504-4e36-88ce-4a18255ac581", "translation" => "The Timimoun open air theater is an enchanting place where art and nature come together. It offers an exceptional cultural experience, although unfortunately, it lacks regular performances.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3917fae2-9733-4bc3-92e4-d877cd9751e4", "translation" => "Le théâtre en plein air de Timimoun est un lieu enchanteur où l'art et la nature se rejoignent. Il offre une expérience culturelle exceptionnelle, bien que malheureusement, il manque de représentations régulières.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ae1a1589-2620-4725-a0a2-a50661392d5d", "translation" => "مسرح تيميمون الهواء الطلق هو مكان ساحر حيث يتلاقى الفن والطبيعة. إنه يقدم تجربة ثقافية استثنائية، على الرغم من أنه يفتقر إلى العروض الدائمة بالأسف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //909
            ["id" => "2ddfab13-8712-4226-aa4d-a77648d2060a", "translation" => "The ksours of Aghlad are splendid examples of fortresses that dot the ancient caravan routes connecting North and Sub-Saharan Africa. These Saharan architectural and urban complexes are an integral part of Algeria's historical heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "083c6428-df97-4f7b-84cc-2e8ecab9bf47", "translation" => "Les ksour d'Aghlad sont de magnifiques exemples de forteresses qui jalonnent les anciens itinéraires caravanes reliant le Nord et le Sud de l'Afrique sub-saharienne. Ces ensembles architecturaux et urbains sahariens font partie intégrante du patrimoine historique de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "715df451-9c9c-41d4-8207-09fc5987ac29", "translation" => "قصور أغلاد هي أمثلة رائعة للحصون التي تزين طرق القوافل القديمة التي تربط شمال وجنوب الصحراء. هذه المجموعات المعمارية والحضرية الصحراوية هي جزء لا يتجزأ من التراث التاريخي للجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //910
            ["id" => "8bd75983-1933-417d-b99e-5e416e1a2e0e", "translation" => "Visitors exploring the Ighzer cave will have the opportunity to admire the beauty of nature and enjoy a unique experience in the heart of this exceptional underground landscape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "92deb837-ba62-40aa-88b1-e4fd24a69005", "translation" => "Les visiteurs qui explorent la grotte d'Ighzer auront l'occasion d'admirer la beauté de la nature et de profiter d'une expérience unique au cœur de ce paysage souterrain exceptionnel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f70af9ad-3c61-4f38-a73f-e44ab624f198", "translation" => "الزوار الذين يستكشفون مغارة إغزر سيتاح لهم فرصة لمعاينة جمال الطبيعة والاستمتاع بتجربة فريدة في قلب هذا المناظر الطبيعية السفلية الاستثنائية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //911
            ["id" => "a5bd8d15-c2a4-4d62-a433-6d2f3dacaf76", "translation" => "The ksar of Ighzer is an old ksar that attracts many tourists. It is dominated by an observation tower that allows for long-distance surveillance to detect potential enemy invasions of this kasbah, access to which is very winding and labyrinthine.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "198bcb49-8378-4a17-8820-e39b40850b62", "translation" => "Le ksar d'Ighzer est un vieux ksar qui attire beaucoup de touristes. Il est dominé par une tour d'observation qui permet une surveillance à longue distance pour détecter d'éventuelles invasions ennemies de cette casbah, dont l'accès est très sinueux et labyrinthique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "17c58489-43df-407c-bcf6-f8b327a0069c", "translation" => "قصر إغزر هو قصر قديم يجذب العديد من السياح. يتميز ببرج مراقبة يتيح المراقبة على مسافة بعيدة لاكتشاف أي غزوات محتملة لهذه القصبة، التي يعتبر الوصول إليها متعرجًا ومعقدًا للغاية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //912
            ["id" => "7d5ad2ba-a189-4136-b96e-bf7af58db452", "translation" => "With its imposing walls, fascinating architecture, and historical atmosphere, Ksar Faoun is a true cultural and architectural treasure of the Timimoun region. A visit to this ksar allows you to immerse yourself in the history and timeless beauty of the Algerian Sahara.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "29489959-a6c2-422a-b3e1-5999fdd15c3e", "translation" => "Avec ses murs imposants, son architecture fascinante et son atmosphère historique, ksar Faoun est un véritable trésor culturel et architectural de la région de Timimoun. Une visite dans ce ksar permet de se plonger dans l'histoire et la beauté intemporelle du Sahara algérien .", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ccdee6c4-675d-4c1c-84e1-830475457ba2", "translation" => "بفضل جدرانه الرائعة وهندسته الساحرة وجوهره التاريخي، يُعد قصر فاعون كنزًا حقيقيًا من الثقافة والعمارة في منطقة تيميمون. زيارة هذا القصر تتيح للزوار فرصة الانغماس في تاريخ وجمال صحراء الجزائر الخالد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //913
            ["id" => "8e9ae01f-1197-4431-916a-65c2e0dc1cac", "translation" => "Welcome to Ksar Draa, a mysterious gem nestled in the heart of the dunes, ready to unveil its ancient secrets. Imagine yourself in front of this circular, imposing, and fascinating fortress, lost in a sea of sand.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0b67a4be-f31c-46f4-a1f8-ec1d9c4867de", "translation" => "Bienvenue à ksar Draa, un joyau mystérieux niché au cœur des dunes, prêt à vous dévoiler ses secrets anciens. Imaginez-vous devant ce château fort circulaire, imposant et fascinant, perdu dans un océan de sable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2b48e068-16a4-44f0-a67f-3573ac78a7fc", "translation" => "مرحبًا في قصر الذراع, جوهرة غامضة مختبئة في قلب الكثبان، جاهزة لكشف أسرارها القديمة. تخيل نفسك أمام هذا القلعة الدائرية الضخمة والساحرة، مفقودة في بحر من الرمال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //914
            ["id" => "1a8de1b1-0d09-4d39-98cd-d6fe8c8c939e", "translation" => "Whether you're a history enthusiast, an architecture lover, or simply in search of an authentic experience, Ksar el Kef is a must-visit during your trip to Timimoun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "70e4058a-912a-44e8-8c90-f0863040c8d6", "translation" => "Que vous soyez passionné d'histoire, amateur d'architecture ou simplement en quête d'une expérience authentique, Ksar el Kef est un incontournable lors de votre visite à Timimoun.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "02947fe7-13d3-449f-9e02-84ea01efba38", "translation" => "سواء كنت عاشقًا للتاريخ، أو محبًا للعمارة، أو مجردًا تبحث عن تجربة أصيلة، فإن قصر الكاف هو زيارة لا غنى عنها خلال رحلتك إلى تيميمون.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //915
            ["id" => "feeb66d9-0edf-40be-8b7c-f5784417a015", "translation" => "Ksar Hayha is more than just a historical monument; it's a place filled with emotion and mystery. It invites you to delve into the past and discover the cultural and architectural richness of this region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ccd6414b-538c-430e-ae82-ff31c7fbee25", "translation" => "Ksar Hayha est bien plus qu'un simple monument historique, c'est un lieu chargé d'émotion et de mystère. Il vous invite à plonger dans le passé et à découvrir la richesse culturelle et architecturale de cette région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c5603db8-0878-4562-89f6-467df689a3cc", "translation" => "قصر حيحا ليس مجرد نصب تاريخي، بل هو مكان مملوء بالعاطفة والغموض. إنه يدعوك للغوص في الماضي واكتشاف الثراء الثقافي والمعماري لهذه المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //916
            ["id" => "75eab4d8-ef1e-408b-8180-342af37feab3", "translation" => "Whether you are a history enthusiast, a lover of ancient architecture, or simply curious to explore the remnants of the Roman era, a visit to Bordj Doucen will transport you to the glorious past of this fortress and leave you in awe of its remarkable architecture and strategic location.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "507515a3-bb28-47b3-8e98-02f8482928fd", "translation" => "Que vous soyez passionné d'histoire, amateur de vieilles pierres ou simplement curieux de découvrir les vestiges de l'époque romaine, une visite à Bordj Doucen vous transportera dans le passé glorieux de cette forteresse et vous laissera émerveillé par son architecture remarquable et son emplacement stratégique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5259b0f1-f2d0-45dd-bca7-17ff9bd1fada", "translation" => "سواء كنت مهووسًا بالتاريخ، أو عاشقًا للهندسة المعمارية القديمة، أو مجرد فضولي لاستكشاف آثار العصر الروماني، ستقوم زيارة قلعة برج الدوسن بنقلك إلى الماضي المجيد لهذه القلعة وتركك مندهشًا من هندستها الرائعة وموقعها الاستراتيجي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //917
            ["id" => "a3af43e0-212b-4e16-b885-cf6932d5d1e2", "translation" => "Oued Sadouri offers you an escape from the hustle and bustle of everyday life, allowing you to connect with nature and feel the magic of the desert. It's a place where you can create unforgettable memories and immerse yourself in the timeless beauty of the wilderness.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "09762c02-0bf1-4ff9-8a19-95fb9f347dc1", "translation" => "Oued Sadouri vous offre une évasion loin du tumulte de la vie quotidienne, vous permettant de vous connecter avec la nature et de ressentir la magie du désert. C'est un endroit où vous pourrez créer des souvenirs inoubliables et vous imprégner de la beauté intemporelle de la nature sauvage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5510a5ce-ee1d-4b0d-801b-c4e3ed83b1a2", "translation" => "واد السادوري يقدم لك فرصة للهروب بعيدًا عن صخب الحياة اليومية، مما يسمح لك بالاتصال مع الطبيعة وشعورك بسحر الصحراء. إنه مكان حيث يمكنك خلق ذكريات لا تُنسى وغمر نفسك في جمال البرية الخالدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //918
            ["id" => "9efee064-10d5-47b9-9f25-5e05c5dbc2d1", "translation" => "Gottai Land strives to create moments of joy, wonder, and shared experiences for families and friends. In addition to the attractions, the park offers various dining options, souvenir shops, and resting areas for relaxation and recharging between adventures.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "29ebd263-06a8-4fbe-90a1-ba13a46b88f0", "translation" => "Gottai Land s'efforce de créer des moments de joie, d'émerveillement et de partage en famille ou entre amis. En plus des attractions, le parc dispose de diverses options de restauration, de boutiques de souvenirs et de zones de repos pour se détendre et reprendre des forces entre les aventures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "23bf0db3-a4b9-4eeb-b28d-6656aa6d6d04", "translation" => "ڨطاي لاند تسعى لخلق لحظات من الفرح والدهشة والمشاركة بين العائلة والأصدقاء. بالإضافة إلى الألعاب والمرافق الترفيهية، يوفر المنتزه خيارات متنوعة للتناول ومتاجر لشراء الهدايا التذكارية ومناطق للراحة للاسترخاء واستعادة القوى بين المغامرات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //919
            ["id" => "ba2a1906-116b-4fc6-9554-604ef280019a", "translation" => "The Charles de Foucauld Monastery is more than just a historical site. It's a place where one can experience an atmosphere of contemplation and deep spirituality. Whether you are a pilgrim or a curious visitor, a visit to this hermitage allows us to better understand the incredible journey and legacy left by this extraordinary figure.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "855bdbe1-b47f-4039-9e0f-c63b33bf8c3b", "translation" => "Le monastère Charles de Foucauld est bien plus qu'un simple lieu historique. C'est un endroit où l'on peut ressentir une atmosphère de recueillement et de profonde spiritualité. Que l'on soit pèlerin ou simple visiteur curieux, la visite de cet ermitage nous permet de mieux comprendre l'incroyable parcours et l'héritage laissé par cette figure extraordinaire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4b8ee62c-03ca-4371-b217-3382ee098d7c", "translation" => "دير شارل دو فوكو هو أكثر من مجرد موقع تاريخي. إنه مكان يمكننا فيه أن نشعر بجو من التأمل والروحانية العميقة. سواء كنت حاجًا أو زائرًا فضوليًا، فإن زيارة هذا الدير تسمح لنا بفهم أفضل للرحلة الرائعة والتراث الذي تركه هذا الشخص الاستثنائي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //920
            ["id" => "834e6aa8-d4f5-46ac-b8f4-835cd6a16692", "translation" => "The museum houses a significant collection of minerals, fossils, and prehistoric objects from excavations conducted in various regions. It showcases a variety of animals, plants, and rocks from the area, providing a captivating glimpse into the natural and geological richness of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "25266eb1-6183-40fc-98a4-e46742f13954", "translation" => "Le musée abrite une importante collection minéralogique, fossilifère et d'objets préhistoriques provenant des fouilles menées dans diverses régions. Il offre une diversité d'animaux, de plantes et de roches de la région, offrant ainsi un aperçu captivant de la richesse naturelle et géologique de la zone.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "afdc59a2-205a-4afe-9e6c-07cc9faffdb9", "translation" => "يضم المتحف مجموعة هامة من المعادن والأحافير والأشياء القديمة من الحفريات التي أُجريت في مناطق متنوعة. يعرض مجموعة متنوعة من الحيوانات والنباتات والصخور من المنطقة، مما يقدم نظرة جذابة إلى الثراء الطبيعي والجيولوجي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //921
            ["id" => "e387b65e-ac05-4e15-917e-6be08cb11e21", "translation" => "The Ksar of Beni Abbes is much more than just an architectural ensemble; it's a true journey through time, offering visitors the opportunity to discover and immerse themselves in the cultural and historical richness of the region. It's a must-visit place for history enthusiasts, architecture lovers, and those interested in ancient traditions.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3aa9bb66-e0e3-45cb-8203-7fa710647905", "translation" => "Ksar de Beni Abbès est bien plus qu'un simple ensemble architectural, c'est un véritable voyage dans le temps, offrant aux visiteurs l'occasion de découvrir et de s'imprégner de la richesse culturelle et historique de la région. C'est un lieu à ne pas manquer pour les amateurs d'histoire, d'architecture et de traditions ancestrales.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6ad542c4-f341-47b3-a889-8fb3e1eca2fb", "translation" => "قصر بني عباس هو أكثر من مجرد مجموعة معمارية، إنه رحلة حقيقية عبر الزمن، تقدم للزوار فرصة لاكتشاف وغمر أنفسهم في الثراء الثقافي والتاريخي للمنطقة. إنه مكان لا يجب تفويته لعشاق التاريخ وعشاق العمارة وأولئك الذين يهتمون بالتقاليد القديمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //922
            ["id" => "378b00d1-2bf7-4046-94e6-2577beaf076a", "translation" => "Ksar el Ouata is one of the oldest and most precious architectural treasures in the region. With a history dating back several centuries, this iconic structure has stood the test of time and has been restored multiple times to preserve its beauty and authenticity. Today, it welcomes visitors, offering a captivating glimpse into the region's rich past.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9bc8e7cc-d5d3-455d-8430-8a563ff3a4fa", "translation" => "Ksar el Ouata est l'un des trésors architecturaux les plus anciens et précieux de la région. Avec une histoire remontant à plusieurs siècles, cet édifice emblématique a traversé les époques et a été restauré à plusieurs reprises pour préserver sa beauté et son authenticité. Aujourd'hui, il s'ouvre aux visiteurs, offrant un aperçu captivant du passé riche de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6b5015b4-0f4e-46b1-8a14-a92d2d3cee7e", "translation" => "قصر الواتة هو واحد من أقدم وأثمن الكنوز المعمارية في المنطقة. بتاريخ يعود لعدة قرون، هذا الهيكل الرمزي قاوم مرور الزمن وتم ترميمه مرارًا وتكرارًا للمحافظة على جماله وأصالته. اليوم، يرحب بالزوار، مقدمًا نظرة جذابة على الماضي الغني للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //923
            ["id" => "a84443c8-013e-47a6-ae9a-2d2856ff2e81", "translation" => "The rock engravings of Tamtert are fascinating testimonies of the Neolithic period. While less famous than the rock paintings of Tassili, they contain a treasure of rock art that has been studied since 1863.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aeb3972f-2491-46df-a5ce-562304b77232", "translation" => "Les gravures rupestres de Tamtert sont des témoignages fascinants de la période néolithique. Bien que moins célèbres que les peintures rupestres du Tassili, elles renferment un trésor d'art rupestre qui a été étudié depuis 1863.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8e98ff4f-3a34-4937-ab84-e8d2ac94c1ea", "translation" => "النقوش الصخرية في تامترت هي شهادات رائعة للعصور النيوليتية. على الرغم من أنها أقل شهرة من رسومات الصخور في الطاسيلي, إلا أنها تحتوي على كنز من الفن الصخري تم دراسته منذ عام 1863.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //924
            ["id" => "05493238-c577-4258-99f5-d4e3cd577721", "translation" => "Whether you're a nature enthusiast, a photographer in search of breathtaking landscapes, or simply looking for a peaceful place to recharge, Sebkhet el Melh is a must-visit during your trip to Beni Abbes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3ab6ac11-ed78-4570-8fde-3947508acda6", "translation" => "Que vous soyez un amoureux de la nature, un photographe en quête de paysages époustouflants ou simplement à la recherche d'un endroit tranquille pour vous ressourcer. Sebkhet el Melh est un lieu à ne pas manquer lors de votre visite à Beni Abbes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5079287b-e90d-4f10-b1fd-065f8c2842bc", "translation" => "سواء كنت عاشقًا للطبيعة، مصورًا يبحث عن مناظر خلابة، أو مجردًا تبحث عن مكان هادئ للاسترخاء. سبخة الملح هي مكان يجب عليك عدم تفويته أثناء زيارتك إلى بني عباس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //925
            ["id" => "bc2a93e8-e451-4f58-93a5-d1077742866e", "translation" => "An ideal place to relax, recharge, and reconnect with nature in a peaceful environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "64e5a8e2-330d-4153-b4fc-a3e19a0fb089", "translation" => "Un endroit idéal pour se détendre, se ressourcer et se reconnecter avec la nature dans un environnement paisible.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0e88da6b-98c4-485d-8eec-de8cc210e2c5", "translation" => "مكان مثالي للاسترخاء، واستعادة النشاط، وإعادة الاتصال مع الطبيعة في بيئة هادئة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //926
            ["id" => "d5983971-622d-4c8c-a598-fe6c6aacf0d8", "translation" => "By visiting Ksar Badjouda, you will have an unforgettable experience and immerse yourself in an authentic atmosphere rich in history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "64758bd6-5b3c-4435-80ec-3c0a513cc1b6", "translation" => "En visitant Ksar Badjouda, vous vivrez une expérience inoubliable et vous plongerez dans une atmosphère authentique chargée d'histoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1a9f0f16-78c7-4545-b32d-fec6fe4b85e7", "translation" => "من خلال زيارة قصر باجودة, ستعيش تجربة لا تُنسى وتغمر نفسك في جو أصيل محمل بالتاريخ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //927
            ["id" => "b80ad974-8c69-4984-a1a6-7dd2bae34a12", "translation" => "This unique geological formation is a true spectacle to discover. Its resemblance to a lion makes it a natural curiosity that intrigues visitors from around the world. You will be amazed by the power and beauty of this rock prominence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c62dc489-5ad5-437b-a166-f9d6d7d54d0b", "translation" => "Cette formation géologique unique est un véritable spectacle à découvrir. Son apparence similaire à un lion en fait une curiosité naturelle qui intrigue les visiteurs venus des quatre coins du monde. Vous serez émerveillés par la puissance et la beauté de cette éminence rocheuse.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "aad26b5e-31d2-43fd-8c07-c7d50201c50b", "translation" => "هذه التشكيلة الجيولوجية الفريدة هي عرض حقيقي يجب اكتشافه. شبهها بالأسد يجعلها غرابة طبيعية تثير فضول الزوار من جميع أنحاء العالم. ستكونون مندهشين من قوتها وجمالها الصخري.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //928
            ["id" => "580bad74-44a3-4f06-95a0-f9f537d58331", "translation" => "Tamesghida's hot spring is a natural wonder known for its thermal waters at a temperature of 74°C. This spring is renowned for its healing properties and is recommended for relieving various ailments, including rheumatism.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "58e20c9b-623e-49da-8ea1-f1afc90bccb6", "translation" => "La source d'eau chaude de Tamesghida est une merveille naturelle connue pour ses eaux thermales à une température de 74°C. Cette source est réputée pour ses propriétés curatives et est conseillée pour soulager diverses affections, notamment les rhumatismes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e013350b-0bb2-46be-a4ce-97ca473d2c29", "translation" => "يعتبر ينبوع تمزڨيدة الحار عجائب طبيعية معروفة بمياهها الحرارية التي تصل إلى درجة حرارة 74 درجة مئوية. يشتهر هذا الينبوع بخصائصه العلاجية ويُنصح به للتخفيف من مشكلات متنوعة، بما في ذلك الروماتيزم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //929
            ["id" => "ce7f7fcb-c409-4e51-8eb8-69b129ae7930", "translation" => "The history of the Green Mosque dates back to its construction in 1900 by the villagers, who all contributed to its realization. The minaret was specifically built by El Akhdar Benattalah. Today, this mosque is considered a unique historical and cultural landmark of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "019191b3-22a4-49d5-bcdd-82bccb829abf", "translation" => "L'histoire de la mosquée verte remonte à sa construction en 1900 par les habitants du village, qui ont tous contribué à sa réalisation. Le minaret a été spécifiquement construit par el Akhdar Benattalah. Aujourd'hui, cette mosquée est considérée comme un témoin historique et culturel unique de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bd23738f-776f-4964-98df-244373118a4b", "translation" => "يعود تاريخ المسجد الأخضر إلى بنائه في عام 1900 من قبل سكان القرية، الذين ساهموا جميعًا في تنفيذه. تم بناء المئذنة بشكل خاص من قبل الأخضر بن عطالة. اليوم، يُعتبر هذا المسجد شاهدًا تاريخيًا وثقافيًا فريدًا في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //930
            ["id" => "adb888eb-7fb9-49ae-8aa5-31292b30126b", "translation" => "Ksar Tamarna is a true architectural masterpiece. Dating back to the Rostomid era, it is considered one of the ancient palaces of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "03e869aa-d28c-4897-8856-36c132bca7b8", "translation" => "Ksar Tamarna est un véritable chef-d'œuvre d’architecture. Remontant à l'ère Rostomide, il est considéré comme l'un des anciens palais de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b6b7bce0-4784-4fa1-9c64-6c4a9ebc6b1b", "translation" => "قصر تمرنة هو عمل فني معماري حقيقي. يعود تاريخه إلى عصر الرستميين ويُعتبر واحدًا من القصور القديمة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //931
            ["id" => "37f2076a-5f32-4423-a07c-ae6ac1f3250f", "translation" => "Chott Marouane is a true gem of the region, drawing visitors in search of a unique experience. This seasonal saltwater lake, nestled in the heart of the Algerian desert, offers a spectacular landscape and a mystical ambiance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4769276d-7e3e-4b14-b588-cbff59785715", "translation" => "Chott Marouane est un véritable joyau de la région, qui attire les visiteurs en quête d'une expérience unique. Ce lac saisonnier d'eau salée, niché au cœur du désert algérien, offre un paysage spectaculaire et une ambiance mystique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5c16f006-5433-4cc7-8cc1-1debc908b6fc", "translation" => "شط مروان جوهرة حقيقية في المنطقة، تجذب الزوار الذين يبحثون عن تجربة فريدة. هذا البحيرة الموسمية من مياه مالحة، المختبئة في قلب الصحراء الجزائرية، تقدم مناظر طبيعية رائعة وأجواء غامضة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //932
            ["id" => "a5002dda-5da7-489e-bd20-1b34a4d9b56d", "translation" => "Whether you want to have fun, relax, or simply connect with nature, the Soummam entertainment garden is the perfect place. Come escape from your daily routine and be enchanted by this oasis of fun and relaxation in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "84db0cd8-79de-472d-b462-bd76a75bab4b", "translation" => "Que vous souhaitiez vous divertir, vous détendre ou simplement vous connecter avec la nature, le jardin de divertissement Soummam est l'endroit idéal. Venez vous évader de la routine quotidienne et laissez-vous séduire par cet oasis de plaisir et de détente au cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "19c29f2b-74f5-46da-a9fa-85e6eb45a56d", "translation" => "سواء كنت ترغب في التسلية، الاسترخاء، أو ببساطة التواصل مع الطبيعة، حديقة الصومام للراحة والتسلية هي المكان المثالي. تعال للاستمتاع بالهروب من الروتين اليومي واستسلم لسحر هذا الواحة من المرح والاسترخاء في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //933
            ["id" => "2d3fec11-aa48-4c01-9515-574ae1dfffa9", "translation" => "Visiting Ksar Ouaghlana is delving into the captivating history of the Oued Righ region and discovering the remnants of a civilization rich in traditions and cultural heritage. Despite the trials it has endured, Ouaghlana continues to bear witness to the resilience and pride of its inhabitants. Come explore this fascinating town and let yourself be transported on a journey through time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8b47022e-4ca5-490c-b10b-c61bfd6101ab", "translation" => "Visiter ksar Ouaghlana, c'est plonger dans l'histoire captivante de la région d'Oued Righ et découvrir les vestiges d'une civilisation riche en traditions et en héritage culturel. Malgré les épreuves qu'elle a traversées, Ouaghlana continue de témoigner de la résilience et de la fierté de ses habitants. Venez explorer cette ville fascinante et laissez-vous transporter dans un voyage à travers le temps.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d429af8a-729e-4b08-a46f-4f61b592522b", "translation" => "زيارة قصر وغلانة هي الغوص في تاريخ مثير لمنطقة وادي ريغ واكتشاف آثار حضارة غنية بالتقاليد والتراث الثقافي. على الرغم من التحديات التي مرت بها، تستمر وغلانة في شهادة على صمود وفخر سكانها. تعال واستكشف هذه المدينة الرائعة واسمح لنفسك بأن تنقلك في رحلة عبر الزم", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //934
            ["id" => "7704dec3-30e6-46f5-a1ac-435b51681e21", "translation" => "This church, although in ruins, continues to pique the interest and admiration of visitors seeking to understand Djemaa's past and heritage. It bears witness to the cultural richness and diversity of the region, inviting everyone to reflect on the importance of respecting and preserving our shared heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6a42c948-595a-447f-9bd2-495cf3e91789", "translation" => "Cette église, bien qu'en ruine, continue de susciter l'intérêt et l'admiration des visiteurs qui cherchent à comprendre le passé et l'héritage de Djemaa. Elle témoigne de la richesse culturelle et de la diversité de la région, et invite chacun à méditer sur l'importance du respect et de la préservation de notre patrimoine commun.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0abafe26-ab7d-45df-acdf-1f30c0c6bfbd", "translation" => "هذه الكنيسة، على الرغم من أنها في حالة تدهور، لا تزال تثير اهتمام وإعجاب الزوار الذين يسعون لفهم ماضي جامعة وتراثها. إنها تشهد على الثراء الثقافي والتنوع في المنطقة، وتدعو الجميع إلى التفكير في أهمية احترام والمحافظة على تراثنا المشترك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //935
            ["id" => "c761608f-8589-4fb1-b61a-d5ba03ea089d", "translation" => "Whether you're an art enthusiast, a craft lover, or simply curious to discover local talents, the Djemaa craft house will offer you an enriching experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d093a074-7e1f-4fbe-b446-a277e5d4c4ec", "translation" => "Que vous soyez amateur d'art, passionné d'artisanat ou simplement curieux de découvrir les talents locaux, la maison de l'artisanat de Djemaa vous offrira une expérience enrichissante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fa0080e6-508d-4e91-ad80-fa521d6efdd5", "translation" => "سواء كنت عاشقًا للفن، مهتمًا بالحرف اليدوية، أو مجرد فضولي لاكتشاف المواهب المحلية، ستقدم لك دار الصناعة التقليدية في جامعة تجربة غنية ومثرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //936
            ["id" => "a7bcffb4-d3fd-4b74-a9c7-659437ca0a5f", "translation" => "Whether you're seeking a peaceful getaway, nature exploration, or simply a unique experience, the Ayata lake is a place not to be missed during your visit to the Sidi Amrane region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6ea08170-01dc-432f-9b2e-4e4b5745cf42", "translation" => "Que vous soyez à la recherche d'une escapade paisible, d'une exploration de la nature ou simplement d'une expérience unique, le lac Ayata est un endroit à ne pas manquer lors de votre visite dans la région de Sidi Amrane.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "261151ac-6c75-47ea-904a-904191039085", "translation" => "سواء كنت تبحث عن إجازة هادئة، استكشاف للطبيعة، أو مجرد تجربة فريدة، فإن بحيرة عياطة هي مكان يجب عدم تفويته أثناء زيارتك لمنطقة سيدي عمران.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //937
            ["id" => "683fc2a4-7fad-4732-82e4-f4c5f94b074f", "translation" => "Ksar el Menia, built by a faction of the Zenatas between the 9th and 10th centuries, is an architectural treasure of great importance in the city. It represents one of the most significant urban monuments in the region and stands out for its imposing size.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cae1bab8-571c-4191-90b8-e03faad34e87", "translation" => "Ksar el Menia, construit par une faction des Zenâtas entre les 9ème et 10ème siècles, est un trésor architectural d'une grande importance dans la ville. Il représente l'un des plus importants monuments urbains de la région et attire l'attention par sa taille imposante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e037b0bc-6a95-41d9-a96a-cc6633f9944d", "translation" => "قصر المنيـــعة, الذي شيدته إحدى فصائل الزناتة بين القرنين التاسع والعاشر، هو كنز معماري ذو أهمية كبيرة في المدينة. إنه يمثل واحدًا من أهم المعالم الحضرية في المنطقة ويبرز بحجمه الضخم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //938
            ["id" => "7d73f1fb-f4c8-46d8-86cf-144d8e0c1f10", "translation" => "The el Menia museum is a true treasure that provides a captivating glimpse into the civilizations that have left their mark on the region. It serves as a valuable record of past events while playing an essential role in the development and promotion of local tourism.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "02c06e55-79f3-4725-8ec5-03056f19dd54", "translation" => "Le musée d'el Menia est un véritable trésor qui offre un regard captivant sur les civilisations qui ont marqué la région. Il constitue un registre précieux des événements passés, tout en jouant un rôle essentiel dans le développement et la promotion du tourisme local.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "88312604-f840-483a-a289-b8a6d15cbca8", "translation" => "متحف المنيـــعة كنز حقيقي يقدم نظرة جذابة على الحضارات التي طبعت المنطقة. إنه سجل قيم للأحداث الماضية، بالإضافة إلى أنه يلعب دورًا أساسيًا في تطوير وتعزيز السياحة المحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //939
            ["id" => "160272b9-a0f9-4cd6-a567-3766cf488f07", "translation" => "As one of the oldest monuments in the city, the Saint Joseph's church is a testament to the colonial era and French influence in the region. Its proximity to the tomb of the monk Charles de Foucault adds to its remarkable character.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f55fb83e-c557-4b73-9f16-86c91890ed89", "translation" => "En tant qu’un des plus anciens monuments de la ville, l'église Saint Joseph est un témoignage de l'époque coloniale et de l'influence française dans la région. Sa proximité avec le tombeau du moine Charles de Foucault ajoute à son caractère remarquable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "451caca8-a116-4dbd-b581-137e4eea16c6", "translation" => "كواحدة من أقدم المعالم في المدينة، كنيسة القديس يوسف تشكل شهادة على العصر الاستعماري والتأثير الفرنسي في المنطقة. قربها من قبر الراهب شارل دو فوكو يضيف إلى طابعها الاستثنائي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //940
            ["id" => "c8981213-4722-4391-aa49-41a062538a12", "translation" => "The Forum garden is a peaceful haven located to the south of the municipality of Hassi Gara. This enchanting place offers a green oasis where you can find beautiful roses, fragrant citrus trees, and even small animals that add to the picturesque ambiance of the area.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c68eed7f-2971-4668-9566-2469ee0bf49b", "translation" => "Le jardin du Forum est un havre de paix situé au sud de la commune de Hassi Gara. Cet endroit enchanteur offre une oasis verdoyante où l'on peut trouver de magnifiques roses, des agrumes odorants et même de petits animaux qui ajoutent à l'ambiance pittoresque du lieu.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cf25c9e9-5d1b-4eac-85b0-6d90e5cc7668", "translation" => "حديقة فورام هي ملاذ للسلام يقع جنوب بلدية حاسي القارة. هذا المكان الساحر يقدم واحة خضراء حيث يمكنك العثور على ورود جميلة وأشجار حمضيات عطرة، وحتى الحيوانات الصغيرة التي تضيف إلى الأجواء الخلابة للمكان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //941
            ["id" => "efe18a5b-f762-4406-8272-a902170be809", "translation" => "Whether you're looking for a relaxation spot, an outdoor experience, or a peaceful getaway in nature, the Hassi Gara lake provides a tranquil and magical atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2ea49799-17a4-4122-a215-a5d556d563ad", "translation" => "Que vous soyez à la recherche d'un lieu de détente, d'une expérience de plein air ou d'une escapade paisible en pleine nature, le lac de Hassi Gara offre une atmosphère tranquille et magique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "13b19f9b-0dd5-49d4-8f38-8797daa68758", "translation" => "سواء كنت تبحث عن مكان للاسترخاء، أو تجربة في الهواء الطلق، أو هروبًا هادئًا في الطبيعة، تقدم بحيرة حاسي القارة أجواءً هادئة وساحرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //942
            ["id" => "104259a8-97e5-4fa3-ba99-b8d39b9f6f9c", "translation" => "Surrounded by breathtaking desert scenery, the el Menia lake offers a striking contrast between its tranquil waters and the surrounding stretches of sand. It's an ideal place to connect with nature, observe birdlife, and enjoy the serenity and natural beauty of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0b6a2a98-0a5f-4736-83ce-41d487377611", "translation" => "Entouré d'un paysage désertique à couper le souffle, le lac d'el Menia offre un contraste saisissant entre ses eaux paisibles et les étendues de sable environnantes. C'est un endroit idéal pour se connecter à la nature, observer la faune aviaire et profiter de la tranquillité et de la beauté naturelle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3ef3ec0c-704f-40e9-9e21-302136436ba3", "translation" => "محاطًا بمناظر صحراوية رائعة تأسر الأنفاس، تقدم بحيرة المنيعة تباينًا مذهلاً بين مياهه الهادئة ومساحات الرمال المحيطة به. إنه مكان مثالي للاتصال بالطبيعة، ومراقبة الطيور، والاستمتاع بالسكينة والجمال الطبيعي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //943
            ["id" => "274a0650-5721-4a0b-9ebc-8a8c3f41e946", "translation" => "Whether it's to admire the natural beauty, relax, or soak in the unique desert atmosphere, the salt lake of Hassi Gara is a must-visit destination for nature lovers and adventurous travelers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "247dc850-5f45-41f4-8801-51d4c33d6828", "translation" => "Que ce soit pour contempler la beauté naturelle, se détendre ou s'imprégner de l'atmosphère unique du désert, le lac salé de Hassi Gara est une destination incontournable pour les amoureux de la nature et les voyageurs en quête d'aventure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cd8f5657-86ce-45cc-9590-17277ffc94a6", "translation" => "سواء كنت ترغب ان ترى الجمال الطبيعي أو الاسترخاء أو الاستمتاع بالجو الفريد في الصحراء، فإن بحيرة حاسي القارة المالحة هي وجهة لا غنى عنها لعشاق الطبيعة والمسافرين الباحثين عن المغامرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //944
            ["id" => "5a8e8597-0629-4c35-9cb7-2409e04ef61a", "translation" => "Don't wait any longer to have an unforgettable experience in the heart of the alder grove of Ain Khiar. Come and explore this haven of peace, connect with nature, and marvel at the incredible diversity of flora and fauna.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3aa0fa71-6771-4e90-96f0-135ef125a075", "translation" => "N'attendez plus pour vivre une expérience inoubliable au cœur de l'Aulnaie de Aïn Khiar. Venez explorer ce havre de paix, vous connecter à la nature et vous émerveiller devant la diversité incroyable de la faune et de la flore.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bf46c781-6b41-4e94-a675-bae82ea1f57a", "translation" => "لا تنتظر أكثر لتعيش تجربة لا تُنسى في قلب بستان عين خيار. تعال واستكشف هذا ملاذ السلام، وتواصل مع الطبيعة، وتعجب من تنوع الرائع في النباتات والحيوانات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //945
            ["id" => "b885b02e-81a0-4f20-aad4-19e62db7e9df", "translation" => "Whether you're a history enthusiast or simply curious to gain a better understanding of Algeria's past, the mujahid museum in el Tarf is a must-visit destination. It provides a unique perspective on the struggle for independence and pays tribute to the heroes of that tumultuous period.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3444e0e8-8549-44ee-9566-6cf7fd1d124f", "translation" => "Que vous soyez un passionné d'histoire ou simplement curieux de mieux comprendre le passé de l'Algérie, le musée du Moudjahid d'El Tarf est un lieu incontournable à visiter. Il offre une perspective unique sur la lutte pour l'indépendance et permet de rendre hommage aux héros de cette période tumultueuse.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b1133cfd-b225-4824-baec-61d42fd72fee", "translation" => "سواء كنت عاشقًا للتاريخ أم مجرد فضولي لفهم المزيد عن ماضي الجزائر، فإن متحف المجاهد في الطارف هو وجهة يجب زيارتها. إنه يقدم منظورًا فريدًا حول النضال من أجل الاستقلال ويسمح بتكريم أبطال تلك الفترة العصيبة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //946
            ["id" => "754f9f21-8b25-4687-82aa-a2f271c431d9", "translation" => "Whether you're a history enthusiast, a nature lover, or seeking an unforgettable experience, the cursed island promises captivating discoveries and lasting memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "da0ee390-448a-4e9e-9dd6-4d8c0e1d3ef0", "translation" => "Que vous soyez passionné d'histoire, amoureux de la nature ou à la recherche d'une expérience inoubliable, l’île maudite vous promet des découvertes captivantes et des souvenirs impérissables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5fe2ffd4-7f0a-4d4c-a04a-ca181522e546", "translation" => "سواء كنت عاشقًا للتاريخ، أو محبًا للطبيعة، أو تبحث عن تجربة لا تُنسى، تعد الجزيرة الملعونة وعدًا بالاكتشافات المثيرة والذكريات اللا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //947
            ["id" => "ae9c7c87-af51-471f-9cba-41589ad660fb", "translation" => "Whether you're a nature enthusiast, an engineering aficionado, or just seeking a tranquil getaway, the Mexa dam is a place not to be missed.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "55ea6069-1f01-4d83-9dc9-24d30f655e9c", "translation" => "Que vous soyez un amoureux de la nature, un passionné d'ingénierie ou simplement à la recherche d'une escapade apaisante, le barrage de Mexa est un lieu à ne pas manquer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7228c50b-6ad5-44d5-9ae0-a9549aecf091", "translation" => "سواء كنت عاشقًا للطبيعة، أو مهووسًا بالهندسة، أو مجرد البحث عن مكان هادئ للاسترخاء، فإن سد ماكسة هو مكان يجب عليك عدم تفويته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //948
            ["id" => "0c417d6a-3f41-49bd-ad2d-ade20b3caea0", "translation" => "Come and explore this remarkable structure, immerse yourself in its peaceful atmosphere, and admire the harmonious blend of human and nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0b6eb043-4a54-40af-bef9-eaa0d5e8aa15", "translation" => "Venez découvrir cet ouvrage remarquable, imprégnez-vous de son ambiance paisible et admirez la combinaison harmonieuse de l'homme et de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f02be6a8-e6fd-4083-a793-9a7ea5a48a12", "translation" => "تعال واكتشف هذا العمل الملحوظ، امتلك أجواءه الهادئة وأعجب بالتوازن المتناغم بين الإنسان والطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //949
            ["id" => "afc74cdb-e8e3-4643-a4a2-1544c2924747", "translation" => "The black lake bog is a natural site of exceptional beauty that deserves to be explored. Once a lake, it was transformed into a unique peatland due to a drainage accident during the drilling of a drinking water well. This fascinating place offers a rare opportunity to observe the evolution of vegetation over time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "86648031-c736-411d-adf5-c41bc54ed5b9", "translation" => "La tourbière du lac noir est un site naturel d'une beauté exceptionnelle qui mérite d'être exploré. Autrefois un lac, il a été transformé en une tourbière unique suite à un accident de drainage lors du forage d'un puits d'eau potable. Cet endroit fascinant offre une occasion rare d'observer l'évolution de la végétation au fil du temps.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8ad5639d-f955-4e16-bd71-8649e72b7256", "translation" => "يعد مستنقع البحيرة السوداء موقعًا طبيعيًا يتمتع بجمال استثنائي يستحق الاستكشاف. كانت في السابق بحيرة، وقد تم تحويلها إلى مستنقع خث فريد من نوعه بعد حادث الصرف أثناء حفر بئر لمياه الشرب. يوفر هذا المكان الرائع فرصة نادرة لمراقبة تطور الغطاء النباتي مع مرور الوقت.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //950
            ["id" => "4e00967e-a7fe-4d4a-aa9d-abd686a6555d", "translation" => "Welcome to the Sidi Djaballah thermal resort, a true haven of well-being and healing. This destination offers you a traditional hammam where you can enjoy the benefits of slightly sulfur-rich waters, known for their healing properties.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "52c59a23-fea7-440f-bd2a-e99474d10a2e", "translation" => "Bienvenue à la station thermale de Sidi Djaballah, un véritable havre de bien-être et de guérison. Cette destination vous offre un hammam traditionnel où vous pourrez profiter des bienfaits des eaux légèrement soufrées, connues pour leurs propriétés curatives.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7d10ea25-b4c7-46e6-a748-273054e32fb1", "translation" => "مرحبًا بك في منتجع سيدي جاب الله, وهو ملاذ حقيقي للرفاهية والشفاء. تقدم لك هذه الوجهة حمام حراري تقليدي حيث يمكنك الاستفادة من فوائد المياه ذات الكبريت الخفيفة، المعروفة بخصائصها العلاجية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //951
            ["id" => "07e79753-0963-4490-bb1b-85e754e04371", "translation" => "Whether you're seeking adventure, outdoor relaxation, or family fun, the Wooden Park recreational forest is the perfect destination for a memorable getaway. Come and discover the magic of this forest and create unforgettable memories in the heart of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aad8c35e-1b70-4ea5-8584-672728ed02bc", "translation" => "Que vous soyez à la recherche d'aventures, de moments de détente en plein air ou de jeux en famille, la forêt récréative Wooden Park est l'endroit parfait pour une escapade mémorable. Venez découvrir la magie de cette forêt et créer des souvenirs inoubliables au cœur de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ed4e07b7-b5ae-4378-9507-ee6a40d8386a", "translation" => "سواء كنت تبحث عن المغامرة، أو لحظات الاسترخاء في الهواء الطلق، أو الترفيه العائلي، فإن غابة وودن بارك الترفيهية هي الوجهة المثالية للهروب وصنع ذكريات لا تُنسى في قلب الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //952
            ["id" => "13d1ffd7-eb13-478f-88b7-7b2163dd2b2c", "translation" => "El Malah provides an ideal setting for sunbathing. Lie down on your towel, allow the sun to warm your skin, and relish in moments of complete tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "721e6e84-4e3d-4b50-8694-68a0e50c45a8", "translation" => "El Malah est le lieu idéal pour se prélasser au soleil. Allongez-vous sur votre serviette, laissez le soleil caresser votre peau et profitez de moments de pure détente.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "edb1cf98-2dbd-420d-aae2-a9a55f9ce174", "translation" => "الملاح هو مكان رائع للاستمتاع بأشعة الشمس والاسترخاء. امدد نفسك على منشفتك، دع أشعة الشمس تلامس بشرتك واستمتع بلحظات هادئة ومريحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //953
            ["id" => "114bd491-5eeb-49f3-8601-932928a01053", "translation" => "Swimming enthusiasts will be delighted by the calm and crystal-clear waters of the mountain beach. Dive into the waves, swim, or simply float peacefully. This beach is a true haven of freshness and aquatic enjoyment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "28b49f52-07ef-49d3-aa76-e6f2f61869e7", "translation" => "Les amateurs de baignade seront comblés par les eaux calmes et transparentes de la plage de la montagne. Plongez dans les vagues, nagez ou tout simplement laissez-vous flotter en toute tranquillité. Cette plage est un véritable havre de fraîcheur et de plaisir aquatique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "34bcbca9-15ed-4267-a4e4-70a44e9299e2", "translation" => "سيكون عشاق السباحة مسرورين بمياه شاطئ الجبل الهادئة والصافية. اغمروا أنفسكم في الأمواج، اسبحوا. هذا الشاطئ هو ملاذ حقيقي من الانتعاش والاستمتاع بالمياه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //954
            ["id" => "7b0152cc-21de-48ba-9a22-6c2d10f05c18", "translation" => "This beach provides a peaceful atmosphere, away from the hustle and bustle of big cities. You can take a stroll along the beach, feel the gentle lapping of the waves, and be embraced by a refreshing sea breeze.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dd73792e-3ac7-496f-a4fb-f085b21f67db", "translation" => "Cette plage offre une atmosphère paisible, loin de l'agitation des grandes villes. Vous pourrez vous promener le long de la plage, sentir le doux murmure des vagues et vous laisser envelopper par une brise marine rafraîchissante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "21b258bc-a394-44ea-ab3a-61f8ac7eca62", "translation" => "يقدم هذا الشاطئ جوًا هادئًا بعيدًا عن صخب المدن الكبيرة. يمكنك التجول على طول الشاطئ، والشعور بلطف الأمواج والسماح للنسيم البحري المنعش بأن يلف حولك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //955
            ["id" => "21b52282-eee7-4f02-adc2-5ec315c71fad", "translation" => "Come and discover the splendor of Cap Rosa beach and be captivated by its natural charm. Whether you want to relax, have fun in the water, or simply enjoy the scenery.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1ad80c65-f818-40d8-ab99-561b0a75764b", "translation" => "Venez découvrir la splendeur de la plage de Cap Rosa et laissez-vous séduire par son charme naturel. Que vous souhaitiez vous détendre, vous amuser dans l'eau ou simplement profiter du paysage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8f08eda0-2b8f-4caf-866f-4bd4e0e2aa19", "translation" => "تعال واكتشف روعة شاطئ كاب روزا واستمتع بسحره الطبيعي. سواء كنت ترغب في الاسترخاء أو المرح في الماء أو مجرد الاستمتاع بالمناظر الطبيعية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //956
            ["id" => "b06fc53a-5ef8-429c-9bf1-e83d82b228ad", "translation" => "If you're looking for relaxation or water fun, this beach is the perfect place to spend unforgettable moments by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "31458fd8-e57a-4d8e-9b52-3fddd6d395a7", "translation" => "Si vous êtes en quête de détente ou de plaisir aquatique, cette plage est l'endroit idéal pour passer des moments inoubliables au bord de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bd26eb06-0541-4bed-9a70-510d3e35b1ab", "translation" => "إذا كنت تبحث عن الاسترخاء أو المرح في المياه، هذا الشاطئ هو المكان المثالي لقضاء لحظات لا تُنسى على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //957
            ["id" => "aa1f6acc-f957-4efc-870d-38389a7a5dbd", "translation" => "The Chefia dam is not only a crucial pillar for regional development but also a tourist attraction worth exploring. Its economic significance, natural beauty, and recreational opportunities make it a versatile destination that appeals to both locals and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f4392690-6784-4ad5-9e17-bd9dfb17d5b3", "translation" => "Le barrage de Chefia est non seulement un pilier essentiel pour le développement régional, mais aussi une attraction touristique qui mérite d'être découverte. Son importance économique, sa beauté naturelle et ses possibilités de loisirs en font un lieu polyvalent qui séduit aussi bien les habitants que les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "74a8d893-785f-4a8e-a117-ef8f7112ed85", "translation" => "سد الشافية ليس فقط أساسًا أساسيًا للتنمية الإقليمية ولكنه أيضًا معلم سياحي يستحق الاكتشاف. أهميته الاقتصادية وجماله الطبيعي وفرص الترفيه التي يقدمها يجعله وجهة متعددة الاستخدامات تجذب على حد سواء السكان المحليين والزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //958
            ["id" => "d29e1d8b-cca6-46fb-9676-f69194de22bc", "translation" => "The Fkirina beach is perfect for swimming enthusiasts. The clear and shallow waters invite diving, swimming, and playing. Families will find a safe and enjoyable space here to enjoy moments of happiness by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "002142e1-8ab9-4f18-9547-f815eb69c41d", "translation" => "La plage de Fkirina est idéale pour les amateurs de baignade. Les eaux claires et peu profondes invitent à la plongée, à la natation et au jeu. Les familles trouveront ici un espace sûr et agréable pour profiter de moments de bonheur en bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "47116016-3a0a-4606-b78d-ac459cff6842", "translation" => "شاطئ فكيرينة مثالي لهواة السباحة. مياهه الصافية والضحلة تدعو إلى الغطس والسباحة واللعب. ستجد العائلات هنا مكانًا آمنًا وممتعًا للاستمتاع بلحظات من السعادة على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //959
            ["id" => "3ccb9ead-c309-4148-87bf-b80c7ab56c4b", "translation" => "For adventurous and discovery-seeking travelers, el Marsa beach offers a unique and unforgettable experience. Get ready to explore a pristine location and create one-of-a-kind memories in the heart of this challenging-to-reach but incredibly rewarding beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1c270d1e-da5e-4353-90fc-dde1267845e7", "translation" => "Pour les voyageurs avides de découvertes et d'aventures, la plage d'el Marsa offre une expérience unique et inoubliable. Préparez-vous à explorer un lieu préservé et à créer des souvenirs uniques au cœur de cette plage difficile d'accès, mais incroyablement gratifiante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d8af2fe7-f043-4ac0-a92f-75f41c34a576", "translation" => "بالنسبة للمسافرين الذين يبحثون عن الاكتشاف والمغامرة، يقدم شاطئ المرسى تجربة فريدة لا تُنسى. استعد لاستكشاف موقع نقي وإنشاء ذكريات استثنائية في قلب هذا الشاطئ الذي يصعب الوصول إليه ولكنه مكافأة لا تُنسى بالفعل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //960
            ["id" => "b7d84e1c-ac82-4419-9dee-4440b65556cb", "translation" => "El Baleh beach is surrounded by lush vegetation and pristine landscapes, adding a touch of natural charm to the entire site. The green hills in the background create a beautiful contrast with the glistening sea, offering a picturesque and soothing backdrop.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4ae236b6-ce3f-4e81-afe3-8b7ab00e7462", "translation" => "La plage d'el Baleh est entourée d'une végétation luxuriante et de paysages préservés, ajoutant une touche de charme naturel à l'ensemble du site. Les collines verdoyantes en arrière-plan créent un contraste magnifique avec la mer scintillante, offrant un décor pittoresque et apaisant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f0f4ca9e-e6c5-43a8-abe3-3b596bf0d59a", "translation" => "الشاطئ البلح محاط بنباتات خضراء غنية ومناظر طبيعية نقية، مما يضيف لمسة من الجاذبية الطبيعية للموقع بأكمله. تُخلق التلال الخضراء في الخلفية تباينًا جميلًا مع البحر اللامع، مما يقدم خلفية جميلة ومهدئة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //961
            ["id" => "b7e06bab-a281-4c6e-89f6-f9ec7c0a2a91", "translation" => "This beach provides ample space to relax and soak up the sun. Lay out your towel or settle into a comfortable beach chair and let the sound of the waves lull you.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b93b49fc-6866-459b-9821-226e84106b15", "translation" => "Cette plage offre un espace spacieux pour se détendre et profiter du soleil. Étendez votre serviette ou installez-vous confortablement sur un transat, et laissez-vous bercer par le murmure des vagues.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0ce10ef1-d8d5-42e7-84a1-10c8a596f203", "translation" => "يقدم هذا الشاطئ مساحة واسعة للاسترخاء والاستمتاع بأشعة الشمس. امتدوا مناشفكم أو اجلسوا براحة على كراسي واسمحوا لصوت الأمواج بأن يهمس في أذنيكم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //962
            ["id" => "bded1298-fcc9-44c1-840a-3b2b31c255cd", "translation" => "The Hennaya beach is surrounded by preserved natural beauty. Green hills and lush vegetation add a touch of charm to this coastal setting. You can take a stroll along the beach and enjoy the panoramic view of the horizon, creating unforgettable memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6f8ffdf9-6f55-4cbe-b5ae-ffc79ac13891", "translation" => "La plage de Hennaya est entourée d'une beauté naturelle préservée. Des collines verdoyantes et une végétation luxuriante ajoutent une touche de charme à ce cadre côtier. Vous pourrez vous promener le long de la plage et profiter de la vue panoramique sur l'horizon, créant ainsi des souvenirs inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8e2cc629-ff03-4997-b3a4-8e2db7b56d15", "translation" => "شاطئ الحناية محاط بجمال طبيعي محتفظ به. التلال الخضراء والنباتات الغنية تضيف لمسة من الجاذبية إلى هذا الإعداد الساحلي. يمكنك التجول على طول الشاطئ والاستمتاع بالمنظر البانورامي للأفق، مما يخلق ذكريات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //963
            ["id" => "de80a69a-e775-492c-b10d-47c9bf481af0", "translation" => "The Mekhada marshes offer a preserved natural landscape where species diversity and the peaceful beauty of nature come together. Explore this bird sanctuary, observe the lush vegetation, and appreciate the ecological significance of this exceptional region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7b2feff4-45f8-48f8-98fd-08f7dce35674", "translation" => "Les marais de la Mekhada offrent un paysage naturel préservé où la diversité des espèces et la beauté paisible de la nature se rencontrent. Explorez ce sanctuaire d'oiseaux, observez la végétation luxuriante et appréciez l'importance écologique de cette région exceptionnelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b8bd7030-43a4-40e9-a1d1-5790b8d5e6dc", "translation" => "مستنقعات مخادة تقدم مناظر طبيعية محفوظة حيث تتلاقى تنوع وجمال الطبيعة الهادئة. استكشف هذا المحمية الطبيعية للطيور، واستمتع بمراقبة النباتات الخضراء النابضة بالحياة، وامنح الأهمية البيئية لهذه المنطقة الاستثنائية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //964
            ["id" => "d2a05dfd-b8da-4e9f-9123-dbfb96c896e8", "translation" => "The former Oum Tboul border post is a remarkable structure distinguished by its imposing Neo-Moorish architectural style, immediately capturing the attention of architecture and history enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4aff4757-ef0f-4753-9eb0-0b49cf9e4f7a", "translation" => "L'ancien poste frontière d'Oum Tboul est une remarquable construction qui se distingue par son architecture imposante de style Néo-Mauresque, attirant immédiatement l'attention des amateurs d'architecture et d'histoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d5353591-e712-47be-a85b-ab354e981853", "translation" => "مركز أم الطبول الحدودي السابق هو بنية ملحوظة مميزة بنمطها المعماري المغربي الجديد الجبار، مما يلفت فوراً انتباه عشاق العمارة والتاريخ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //965
            ["id" => "912555a5-55f5-46ef-af63-89585009ea98", "translation" => "The craft and trades chamber of El Kala is a lively and vibrant place that showcases the cultural heritage of the region. A must-visit for craft enthusiasts and those curious about authenticity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bf40db21-5e8f-43e6-be36-0a7373f6e734", "translation" => "La chambre de l'artisanat et des métiers d'El Kala est un lieu vivant et vibrant qui met en valeur l'héritage culturel de la région. Une visite incontournable pour les amateurs d'artisanat et les curieux en quête d'authenticité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4ffc0918-9245-47e1-9f08-cbae11e84b44", "translation" => "غرفة الحرف والصناعات في القالة هي مكان حيوي ونابض بالحياة يبرز التراث الثقافي للمنطقة. زيارة لا غنى عنها لعشاق الحرف اليدوية والفضوليين الباحثين عن الأصالة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //966
            ["id" => "ace0a5bf-3985-45c8-afea-c9b369af8435", "translation" => "This square is a lively and dynamic place that embodies the spirit of the city. It provides a gathering and exchange space for residents and visitors alike.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "789bc978-2a4f-49fc-902d-1cce4963985c", "translation" => "Cette place est un lieu animé et dynamique qui incarne l'esprit de la ville. Elle offre un espace de rassemblement et d'échanges pour les habitants et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ca61fdbf-75a5-4cbb-8bc9-67bf7e52f7c7", "translation" => "هذه الساحة مكان حيوي ودينامي يجسد روح المدينة. إنه يوفر مكانًا للتجمع والتبادل للسكان والزوار على حد سواء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //967
            ["id" => "65228b39-b01f-4472-ba46-972ee5a204b4", "translation" => "Whether to admire the architecture or simply to enjoy the lively atmosphere, the independence square is a must-visit place that embodies the spirit and pride of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6c172334-ba1c-4ce9-99b8-c2901fa41cf9", "translation" => "Que ce soit pour admirer l'architecture ou simplement profiter de l'ambiance animée, la place de l'indépendance est un lieu incontournable qui incarne l'esprit et la fierté de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ad709bd8-f26e-496a-b23b-5b3e2e9076fe", "translation" => "سواءً كنتم ترغبون في الاستمتاع بمشاهدة الهندسة المعمارية أو ببساطة الاستمتاع بالأجواء الحية، ساحة الاستقلال هي مكان لا بد من زيارته والتي تجسد روح وفخر المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //968
            ["id" => "bcb373c0-78bd-40b8-b1ba-317313aca7f2", "translation" => "Whether you're an adrenaline enthusiast seeking thrills or just looking for fun and entertaining moments, Farouk Land amusement park is the perfect place to have unforgettable experiences.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "46934c34-388f-4300-afc2-c5ff841e5cdd", "translation" => "Que vous soyez un amateur d'adrénaline à la recherche de sensations fortes ou simplement en quête de moments ludiques et amusants, le parc d’attractions Farouk Land est l'endroit idéal pour vivre des expériences inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d7164dbb-2b1e-453e-a994-d9692da0aee9", "translation" => "سواء كنت من عشاق التشويق تبحث عن تجارب مثيرة أم أنك تبحث فقط عن لحظات ممتعة ومسلية، إن حديقة التسلية فاروق لاند هي المكان المثالي لتعيش تجارب لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //969
            ["id" => "81c0872f-db81-4573-9caa-3aa51c86f11b", "translation" => "The monument to the Fallen is a poignant and solemn tribute to the soldiers who lost their lives during World War II in North Africa. Located near the English cemetery in Annaba, this monument commemorates their sacrifice and preserves their memory.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5d073fc2-644f-44cc-a000-1ad735c1339c", "translation" => "Le monument aux morts est un témoignage poignant et solennel rendu aux soldats qui ont perdu la vie lors de la Seconde Guerre mondiale en Afrique du Nord. Situé à proximité du cimetière anglais d'Annaba, ce monument commémore leur sacrifice et perpétue leur mémoire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "23ac4fe0-a662-467c-b2e2-6e2039a134b1", "translation" => "النصب التذكاري للأموات هو تكريم مؤثر ومهيب للجنود الذين فقدوا حياتهم خلال الحرب العالمية الثانية في شمال إفريقيا. يقع هذا النصب بالقرب من المقبرة الإنجليزية في عنابة، ويكرم تضحياتهم ويحفظ ذكراهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //970
            ["id" => "63c45274-85ac-4a95-8516-57e24ae90ab7", "translation" => "Whether you're a passionate cinephile or just curious to explore new cinematic perspectives, the Annaba cinematheque is a place not to be missed.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4459aea2-2fbf-4df8-a744-686bad272c29", "translation" => "Que vous soyez un cinéphile passionné ou simplement curieux d'explorer de nouvelles perspectives cinématographiques, la Cinémathèque d'Annaba est un lieu à ne pas manquer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b8e73b48-d482-42cc-a7aa-97a8b5955053", "translation" => "سواء كنت عاشقًا للسينما أو مجرد فضولي لاستكشاف منظورات سينمائية جديدة، فإن سينماتيك عنابة هي مكان يجب عليك عدم تفويته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //971
            ["id" => "56da8e55-b8f4-4bb1-bbe0-e780f2b779a2", "translation" => "Whether you're an avid fisherman, a seafood lover, or just curious about experiencing the fishing life, the Annaba fishing port is a place you shouldn't miss.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1e98eff5-a361-4b64-ab0d-abd62938f332", "translation" => "Que vous soyez passionné de pêche, amateur de fruits de mer ou simplement curieux de découvrir la vie portuaire, le port de pêche d'Annaba est un endroit à ne pas manquer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b37e005a-5216-4022-b59a-c862ae88aefc", "translation" => "سواء كنت عاشقًا لصيد الأسماك، محبًا للمأكولات البحرية، أو مجرد فضولي يسعى لاستكشاف حياة الصيد، ميناء الصيد عنّابة هو مكان يجب أن تزوره.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //972
            ["id" => "1c9d5b95-37e4-46fc-85c8-7026fca29615", "translation" => "Located in a lush and serene setting, this garden provides a space for relaxation and rejuvenation for residents and visitors alike.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "02322087-a097-4deb-904c-efd6af647174", "translation" => "Situé dans un cadre verdoyant et serein, ce jardin offre un espace de détente et de ressourcement pour les habitants et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c001a2fe-cf94-4d68-8355-e129cffb5a6e", "translation" => "موجود في إطار خضراء وهادئ، توفر هذه الحديقة مكانًا للاسترخاء واستعادة النشاط للسكان والزوار على حد سواء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //973
            ["id" => "79b61c94-faa4-41fa-ab8b-a168bcf62f41", "translation" => "Vidro beach is an ideal place to spend a day with family, relax with friends, or simply connect with nature and enjoy the beauty of the coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dab5a031-20af-4a50-a6b6-40af74659492", "translation" => "La plage Vidro est un endroit idéal pour passer une journée en famille, se détendre entre amis ou tout simplement se connecter à la nature et profiter de la beauté de la côte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6833e3de-8d31-4836-8ee5-0d5cf8b788c1", "translation" => "شاطئ فيدرو هو مكان مثالي لقضاء يوم مع العائلة، والاسترخاء مع الأصدقاء، أو ببساطة التواصل مع الطبيعة والاستمتاع بجمال الساحل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //974
            ["id" => "1eeab81f-afdf-42a0-8577-82d4eb053e93", "translation" => "The Jewish beach is a popular destination for sun, sand, and sea enthusiasts. It provides a beautiful setting and clear waters that attract visitors year-round.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "486d08b6-eb14-4466-b4f4-416e994d6356", "translation" => "La plage des juifs est une destination prisée pour les amateurs de soleil, de sable et de mer. Elle offre un cadre magnifique et des eaux claires qui attirent les visiteurs tout au long de l'année.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9941c8f1-f8cc-4f9d-b767-7d4fb4dd44d5", "translation" => "شاطئ اليهود هو وجهة مشهورة لعشاق البحر. إنه يوفر إعدادًا جميلاً ومياها واضحة تجذب الزوار على مدار العام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //975
            ["id" => "bebdf9a2-06ee-4ffa-aa4b-20d60232be96", "translation" => "The Caroube beach is known for its peaceful and tranquil atmosphere, where you can relax on your towel, listen to the gentle sound of the waves, and feel the sea breeze on your face.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cfbb3b25-06c6-47ea-b011-64dbf18d0684", "translation" => "La plage de la Caroube est réputée pour son atmosphère paisible et tranquille où vous pourrez vous relaxer sur votre serviette, écouter le doux bruit des vagues et sentir la brise marine caresser votre visage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "77f4e521-f38c-4261-83a2-e1da16f3394f", "translation" => "شاطئ الخروب مشهور بأجوائه الهادئة والساكنة حيث يمكنك الاسترخاء على منشفتك، والاستماع إلى صوت الأمواج اللطيف، والشعور بنسيم البحر اللطيف على وجهك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //976
            ["id" => "45715897-0bc5-4a75-bd6f-75f6bb81329f", "translation" => "With its enchanting landscape and inviting waters, the Belvedere beach offers an unforgettable experience to all who visit it.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8d1ec483-27eb-48a2-be44-e3511056079b", "translation" => "Avec son paysage enchanteur et ses eaux invitantes, La plage Belvédère offre une expérience inoubliable à tous ceux qui la visitent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "91f8431c-a7bd-4a01-a1d0-facc3f6745b2", "translation" => "مع مناظرها الساحرة ومياهها الجاذبة، يقدم شاطئ المنظر الجميل تجربة لا تُنسى لجميع الذين يزورونه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //977
            ["id" => "f35a0d7a-ec73-4e98-a3ff-467c413bb0cd", "translation" => "The Forest Adventure is a place where children can unleash their imagination, develop their physical skills, and appreciate the beauty of nature. It's an ideal spot for a family day out, celebrating special occasions, or simply escaping the daily routine in a stimulating natural setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0932f742-4041-4f07-bd81-1b79be375a7d", "translation" => "Le Forest Adventure est un lieu où les enfants peuvent laisser libre cours à leur imagination, développer leurs compétences physiques et apprécier la beauté de la nature. C'est un endroit idéal pour passer une journée en famille, célébrer des événements spéciaux ou simplement s'évader de la routine quotidienne dans un cadre naturel stimulant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7caf0789-05fb-4f4c-95e9-225f78c30e13", "translation" => "غابة المغامرات مكان يمكن للأطفال من خلاله أن يطلقوا خيالهم، و يطوروا مهاراتهم الجسدية، ويقدروا جمال الطبيعة. إنه مكان مثالي لقضاء يوم عائلي، أو الاحتفال بمناسبات خاصة، أو مجرد الهروب من الروتين اليومي في بيئة طبيعية محفزة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //978
            ["id" => "1469871f-921c-45cb-94f1-03adf901c769", "translation" => "Whether you're a passionate horse rider or simply curious to explore the equestrian world, the Annaba equestrian club provides a pleasant atmosphere and an enriching experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "006eba03-724b-416d-b9fb-645533f7cbca", "translation" => "Que vous soyez un cavalier passionné ou simplement curieux de découvrir le monde équestre, le club hippique d'Annaba offre une atmosphère agréable et une expérience enrichissante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b2156b3c-1df8-4757-8d14-8ffdcb5b36d0", "translation" => "سواء كنت عاشقًا لركوب الخيل أم مجرد فضولي يرغب في استكشاف عالم الفروسية، يقدم نادي الفروسية في عنابة جوًا ممتعًا وتجربة غنية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //979
            ["id" => "6a956d3c-012c-4a17-a554-14a525a8e20b", "translation" => "Whether you're looking for a peaceful day by the sea or you want to engage in water activities like snorkeling and more, the Ain Barbar beach is a must-visit destination in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "190e403b-c891-485c-bbd9-5dc31e7da1f3", "translation" => "Que vous recherchiez une journée tranquille au bord de la mer ou que vous souhaitiez vous adonner à des activités nautiques telles que la plongée avec tuba ou autre, la plage Ain Barbar est un endroit incontournable dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "491f7375-81f6-4028-987f-c8f2631c96a8", "translation" => "سواء كنت تبحث عن يوم هادئ على شاطئ البحر أو ترغب في ممارسة أنشطة مائية مثل الغوص أو غيرها، شاطئ عين بربر هو وجهة لا بد من زيارتها في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //980
            ["id" => "ad6567bb-1a78-4f9f-b1a9-13a2e55818aa", "translation" => "The ruined house, once a marble sawmill, is a place steeped in history and charm. These ruined premises bear witness to its industrial past in the marble processing industry that once thrived in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bf962565-ab4f-4fdb-8300-90ad5f025ed1", "translation" => "La maison cassée, autrefois une scierie de marbre, est un lieu chargé d'histoire et de charme. Cette bâtisse en ruines témoigne de son passé industriel dans le domaine de la transformation du marbre qui faisait prospérer la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "52b5ec57-8773-4e7a-8640-a7abd8bf52fa", "translation" => "البيت المدمر، الذي كان في السابق مشغل لنشر الرخام، هو مكان محمل بالتاريخ والسحر. تشهد هذه المباني المدمرة على ماضيها الصناعي في مجال صناعة تحويل الرخام التي كانت تزدهر في المنطقة في السابق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //981
            ["id" => "8ee24012-019b-413d-a1dd-eb7af42ea643", "translation" => "This garden is an ideal place to rejuvenate, relax, and enjoy peaceful moments in the outdoors. Whether it's a family outing or simply a way to reconnect with nature, this garden offers a multitude of possibilities to satisfy all visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "51e06f4a-3030-4f59-800b-89367a82c721", "translation" => "Ce jardin est un lieu idéal pour se ressourcer, se détendre et profiter de moments paisibles en plein air. Que ce soit pour une sortie en famille ou simplement pour se reconnecter avec la nature, ce jardin offre une multitude de possibilités pour satisfaire tous les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a5630e59-5920-4bc8-8e97-3af4b7675a55", "translation" => "هذه الحديقة مكان مثالي للاسترخاء والاستمتاع بأوقات هادئة في الهواء الطلق. سواء كان ذلك للخروج مع العائلة أو ببساطة لإعادة الاتصال مع الطبيعة، تقدم هذه الحديقة مجموعة متنوعة من الفرص لإرضاء جميع الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //982
            ["id" => "ab9542d1-64dc-4106-a11f-69f1a687a61d", "translation" => "If you're ready to venture off the beaten path and discover a secluded and hard-to-reach beach, Ellouh beach offers you a unique and authentic experience in the heart of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2e98be3d-caf3-4d9f-bd69-e11d767a4c68", "translation" => "Si vous êtes prêt à vous aventurer hors des sentiers battus et à découvrir une plage préservée et difficile d'accès, la plage Ellouh vous offre une expérience unique et authentique en pleine nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bcdd89b1-bffc-458f-8e01-3fb32ef1e60c", "translation" => "إذا كنت مستعدًا للمغامرة خارج الدروب المعبدة واكتشاف شاطئ نائي وصعب الوصول، فإن شاطئ اللوح يقدم لك تجربة فريدة وأصيلة في قلب الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //983
            ["id" => "dbe43c2b-30a1-4ced-884a-b7e795f76ebe", "translation" => "The Oued el Gueb beach is a picturesque and secluded destination, providing a serene and unspoiled atmosphere. However, it's worth noting that access to this beach can be challenging due to its remote location.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "813ffd49-5c03-496b-a452-32ea5428eb89", "translation" => "La plage Oued el Gueb est une destination pittoresque et isolée, offrant une atmosphère calme et préservée. Cependant, il convient de noter que l'accès à cette plage peut être difficile en raison de son emplacement éloigné.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f79f335c-3571-46c1-a4e9-920c0635b148", "translation" => "شاطئ واد القاب وجهة جميلة ومنعزلة، تقدم أجواء هادئة وخالية من التلوث. ومع ذلك، يجدر بالإشارة إلى أن الوصول إلى هذا الشاطئ يمكن أن يكون صعبًا بسبب موقعه البعيد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //984
            ["id" => "d8a5f26b-5477-4de6-8c1f-eba0fbd9149f", "translation" => "The martyr's memorial in Annaba is a powerful symbol of the struggle for freedom and the determination of a people to defend their rights. It serves as a constant reminder of the importance of preserving and passing on the legacy of the martyrs to future generations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "06076c90-b953-4ad3-b405-47951108bf87", "translation" => "Le mémorial du Martyr d'Annaba est un symbole puissant de la lutte pour la liberté et de la détermination d'un peuple à défendre ses droits. Il représente un rappel constant de l'importance de préserver et de transmettre l'héritage des martyrs pour les générations futures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "af6ccff4-704f-4253-a0a9-de48b1fd77a5", "translation" => "مقام الشهيد في عنابة هو رمز قوي للنضال من أجل الحرية وعزم الشعب على الدفاع عن حقوقه. إنه يعتبر تذكيرًا مستمرًا بأهمية الحفاظ على تراث الشهداء ونقله إلى الأجيال القادمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //985
            ["id" => "6bf7fa53-3483-4571-b166-b7c689d74b58", "translation" => "The Champ de Mars garden offers a soothing getaway where visitors can connect with nature, relax, and enjoy a moment of tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "289cb1ca-8e27-40d7-b59d-b9f26c75706e", "translation" => "Le jardin du Champ de Mars offre une escapade apaisante où les visiteurs peuvent se connecter avec la nature, se détendre et profiter d'un moment de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0bdfb2d3-d28b-4d5b-99d3-8540b64bf396", "translation" => "حديقة شان دو مارس توفر للزوار منفردة هادئة حيث يمكنهم التواصل مع الطبيعة والاسترخاء والاستمتاع بلحظة من الهدوء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //986
            ["id" => "546e7574-1e17-4d9a-be6d-9bde4c366c61", "translation" => "The mausoleum of Sidi Akkacha is a symbol of devotion and reverence for this holy figure, and it offers visitors an enriching and spiritual experience within a historical and cultural setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8bcd5332-6536-4399-a90a-89f8477ba004", "translation" => "Le mausolée de Sidi Akkacha est un symbole de dévotion et de respect envers cette figure sainte, et il offre aux visiteurs une expérience enrichissante et spirituelle dans un cadre historique et culturel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "868a382c-0e17-491f-99dd-d6058e0ccf0b", "translation" => "ضريح سيدي عكاشة هو رمز للتفاني والتقدير نحو هذه الشخصية المقدسة، ويقدم للزوار تجربة غنية وروحية في إطار تاريخي وثقافي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //987
            ["id" => "710052e1-384b-4055-8d68-439853147703", "translation" => "The Sidi Akkacha beach is a must-visit destination for nature lovers and sea enthusiasts. With its enchanting setting and clear waters, it promises a memorable seaside experience and moments of relaxation in harmony with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0200cb83-3c09-4e3e-9988-1e0c3c7d3aeb", "translation" => "La plage Sidi Akkacha est une destination incontournable pour les amoureux de la nature et les adeptes de la mer. Avec son cadre enchanteur et ses eaux claires, elle promet une expérience balnéaire mémorable et des moments de détente en harmonie avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "43017e13-e2da-4fea-96b7-0e4628362005", "translation" => "شاطئ سيدي عكاشة هو وجهة لا غنى عنها لعشاق الطبيعة وعشاق البحر. بفضل موقعه الساحر ومياهه الصافية، يعد هذا الشاطئ تجربة ساحلية لا تُنسى ولحظات استرخاء في انسجام مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //988
            ["id" => "a8dd0984-55e2-4d2f-b082-2df026c4468e", "translation" => "El Redma beach is renowned for its tranquility and pristine natural beauty. It's an ideal place to relax, swim, and soak up the sun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5ca89f01-211a-46b4-837d-b6deb229177b", "translation" => "La plage d’el Redma est réputée pour sa tranquillité et sa beauté naturelle préservée. C'est un endroit idéal pour se détendre, se baigner et profiter du soleil.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "006c2c74-92d4-4a07-8d95-f85d97d76081", "translation" => "شاطئ الردمة مشهور بسكونه وجماله الطبيعي الخالي من التلوث. إنه مكان مثالي للاسترخاء والسباحة والاستمتاع بأشعة الشمس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //989
            ["id" => "27e96d94-d514-4b3b-a051-14c8a45a9140", "translation" => "The Chetaibi beach is a popular spot for both locals and tourists alike. Whether it's a day of family relaxation or simply unwinding by the sea, this beach provides an idyllic setting for relaxation and enjoyment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ac656445-11bf-43c0-872e-3ef8bace65b8", "translation" => "La plage Chetaibi est un endroit populaire pour les habitants et les touristes. Que ce soit pour une journée de détente en famille ou simplement pour se ressourcer au bord de la mer, cette plage offre un cadre idyllique pour se relaxer et se divertir.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4bb7c34f-172f-48b9-81a6-492f31c13d92", "translation" => "شاطئ شطايبي هو مكان مشهور بين السكان المحليين والسياح على حد سواء. سواء كنتم تبحثون عن يوم من الاسترخاء مع العائلة أو مع الأصدقاء, يوفر هذا الشاطئ إعداداً جميلاً للاسترخاء والاستمتاع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //990
            ["id" => "6eadcc59-5aa7-43e2-84bf-4e6c726e5939", "translation" => "The island is a favorite spot for photography enthusiasts, who can capture breathtaking views of the bay, the harbor, and the surrounding marine landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2c531aab-0e1a-40fb-b98b-0ee6165dcdca", "translation" => "L'île constitue un endroit prisé des amateurs de photographie, qui peuvent capturer des vues à couper le souffle de la baie, du port et des paysages marins environnants.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "57a122ff-909e-4915-b7eb-c8780f461123", "translation" => "الجزيرة تعتبر مكانًا مفضلًا لعشاق التصوير، حيث يمكنهم التقاط مناظر رائعة للخليج والميناء والمناظر البحرية المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //991
            ["id" => "3e9cd197-07cf-4698-9956-cb9c9c178d42", "translation" => "The golden sand beach is renowned for its tranquility and preserved natural beauty. It's an ideal place to relax, swim, and soak up the sun. The clear and shallow waters make it a popular spot for families and swimming enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d45fb3da-ee6e-46cc-b72c-7c0aed2808c6", "translation" => "La plage Sable d’or est réputée pour sa tranquillité et sa beauté naturelle préservée. C'est un endroit idéal pour se détendre, se baigner et profiter du soleil. Les eaux claires et peu profondes en font un lieu apprécié des familles et des amateurs de baignade.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "db9cdbdd-4a93-4f6c-a3c2-90d24694ac2e", "translation" => "شاطئ الرمال الذهبية مشهور بسكونه وجماله الطبيعي المحتفظ به. إنه مكان مثالي للاسترخاء والسباحة والاستمتاع بأشعة الشمس. المياه الواضحة والضحلة تجعل منه مكانًا شهيرًا بين العائلات وعشاق السباحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //992
            ["id" => "683195fb-b2c6-40be-99fb-c261db842524", "translation" => "The fishing port of Chetaibi is a bustling and lively place, where you can discover the essence of traditional fishing and enjoy the freshness of seafood products.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a43d9570-50d6-44c2-b8ed-8dcdda15f75c", "translation" => "Le port de pêche de Chetaibi est un lieu plein de vie et d'activité, où l'on peut découvrir l'essence même de la pêche traditionnelle et profiter de la fraîcheur des produits de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ffb8f0c9-28ed-4fc0-99e9-5dcef1cbc92c", "translation" => "ميناء شطايبي لصيد الأسماك هو مكان مليء بالحيوية والنشاط، حيث يمكنك اكتشاف جوهر الصيد التقليدي والاستمتاع بنضارة منتجات البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //993
            ["id" => "c3c42e70-5866-405e-8bd9-3cfbb820c7ca", "translation" => "The roman fountain beach provides a tranquil and natural getaway for beach lovers. With its clear waters, fine sand, and peaceful atmosphere, it's an ideal place to relax, connect with nature, and enjoy the natural beauty of the region's coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "35307e57-3cd8-4855-be66-4697a7c1d7e1", "translation" => "La plage de la Fontaine Romaine offre une escapade tranquille et naturelle pour les amoureux de la plage. Avec ses eaux claires, son sable fin et son ambiance paisible, c'est un endroit idéal pour se détendre, se connecter avec la nature et profiter de la beauté naturelle de la côte de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "73fc136d-c77a-463e-b560-035572634b7a", "translation" => "شاطئ النافورة الرومانية يقدم منطقة هادئة وطبيعية لعشاق البحر. بمياهه الصافية ورماله الناعمة وجوه السلام، فهو مكان مثالي للاسترخاء والاتصال مع الطبيعة والاستمتاع بجمال الساحل الطبيعي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //994
            ["id" => "34b42f9e-97c2-4935-806a-ad12ac365caa", "translation" => "The mosque of Abu Marouane el Sharif, classified as a national heritage site, is a historical gem dating back to the 11th century AD. Its architecture includes military elements that testify to its role in overseeing and protecting the coast against external attacks.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "31b81319-e8ed-41da-9198-c738ab69728f", "translation" => "La mosquée Abou Marouane el Charif, classée au patrimoine national, est un joyau historique datant du XIe siècle après J.C. Son architecture présente des éléments militaires qui témoignent de sa fonction de surveillance et de protection de la côte contre les attaques extérieures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "35056172-e9f4-4eb0-bb40-e225a00dd762", "translation" => "مسجد أبو مروان الشريف، الذي تم تصنيفه كموقع تراث وطني، هو جوهرة تاريخية تعود إلى القرن الحادي عشر الميلادي. تشتمل هندسته على عناصر عسكرية تشهد على دوره في مراقبة وحماية الساحل من الهجمات الخارجية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //995
            ["id" => "3900c08b-1aaf-4d5c-ae8d-ed7e514c5747", "translation" => "It's a rocky beach with a wild charm, known for its natural beauty and peaceful atmosphere. However, it's important to note that this beach is hard to access due to its rugged terrain.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0313398c-9728-4fd0-aefc-4bfa854d7b8b", "translation" => "C'est une plage rocheuse au charme sauvage, réputée pour sa beauté naturelle et son atmosphère tranquille. Cependant, il est important de noter que cette plage est difficile d'accès en raison de son relief accidenté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b72c740b-5bc9-4dd2-a306-7713b8f0a56e", "translation" => "إنه شاطئ صخري بسحر بري، معروف بجماله الطبيعي وأجوائه الهادئة. ومع ذلك، من المهم ملاحظة أن هذا الشاطئ يصعب الوصول إليه بسبب تضاريسه الوعرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //996
            ["id" => "c2014ab6-1992-4beb-ac72-e4b7f582d5a5", "translation" => "The zaouïa of Sidi Brahim is a religious monument of great historical and spiritual significance. It was commissioned by Ali Bey, the ruler of Tunisia, and its construction took the form of a distinctive dome. This zaouïa is one of the most important religious monuments in the city and is dedicated to Sheikh Brahim ben Toumi, one of Annaba's most renowned Sufis, whose tomb is located inside.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d22deccb-b06c-4020-ae77-aa19659438ff", "translation" => "La zaouïa de Sidi Brahim est un monument religieux d'une grande importance historique et spirituelle. Elle a été commandée par Ali Bey, souverain de Tunisie, et sa construction a pris la forme d'un dôme caractéristique. Cette zaouïa est l'un des monuments religieux les plus importants de la ville et est dédiée au cheikh Brahim ben Toumi, l'un des soufis les plus renommés d'Annaba, dont le tombeau est situé à l'intérieur.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6abb64ff-fdcf-423c-af48-a7dd55b45fd3", "translation" => "زاوية سيدي إبراهيم هي نصب ديني ذو أهمية تاريخية وروحية كبيرة. تم تكليفها من قبل علي باي، حاكم تونس، وأخذت بناءها شكل قبة مميزة. هذه الزاوية هي واحدة من أهم المعالم الدينية في المدينة ومكرسة للشيخ إبراهيم بن تومي، أحد أشهر الصوفية في عنابة، حيث يقع مرقده بالداخل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //997
            ["id" => "662e30c2-ac5c-462f-8274-6700cf496341", "translation" => "This garden is a cherished place for residents and visitors seeking a space of relaxation and tranquility in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "08406720-2e83-4804-9085-3cb23702d57c", "translation" => "Ce jardin est un lieu apprécié des habitants et des visiteurs qui recherchent un espace de détente et de tranquillité au cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b4f9bf42-5a22-4424-899c-677d3e922e96", "translation" => "هذه الحديقة مكان محبب للسكان والزوار الذين يبحثون عن مكان للاسترخاء والهدوء في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //998
            ["id" => "180ad266-1f6f-4621-8201-3d8473e442d8", "translation" => "Surrounded by cliffs and spectacular rock formations, the Galgamiz beach offers a unique and picturesque landscape. The rugged rocks create natural pools and secluded coves, adding a touch of privacy to this off-the-beaten-path location.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "67414c10-d772-4c67-8351-5a9f08b6599e", "translation" => "Entourée de falaises et de formations rocheuses spectaculaires, la plage Galgamiz offre un paysage unique et pittoresque. Les rochers escarpés créent des piscines naturelles et des criques isolées, ajoutant une touche d'intimité à cet endroit hors des sentiers battus.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "74d4023a-a81b-468d-8b02-c49e4cd444c4", "translation" => "محاطة بالمنحدرات وتشكيلات صخرية رائعة، يقدم شاطئ قالقاميز مناظر طبيعية فريدة وخلابة. الصخور الوعرة تخلق برك طبيعية وخلجانًا معزولة، مما يضيف لمسة من الخصوصية إلى هذا المكان الذي يقع خارج الدروب المعروفة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //999
            ["id" => "31a72874-627e-48e4-be43-49f7dc3b718f", "translation" => "The Ain Sebsi recreational forest is a true haven of peace and entertainment for children. With its adapted games, picnic areas, and enchanting natural setting, it offers a pleasant and memorable experience for the whole family.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "060edf1e-80c6-4060-a06f-b9abbd92d507", "translation" => "La forêt récréative Ain Sebsi est un véritable havre de paix et de divertissement pour les enfants. Avec ses jeux adaptés, ses espaces de pique-nique et son cadre naturel enchanteur, elle offre une expérience agréable et mémorable pour toute la famille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8f0b7f9b-a1e2-43ad-b052-d2580cd0d30e", "translation" => "غابة عين السبسي الترفيهية هي ملاذ حقيقي للسلام والترفيه للأطفال. بفضل ألعابها المتكيفة ومناطق النزهة والإعداد الطبيعي الساحر، تقدم تجربة ممتعة ولا تُنسى للعائلة بأكملها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1000
            ["id" => "6f67d75b-7ffa-43df-afda-1a06a77d7962", "translation" => "The Marina d'or water park is a perfect place to cool off, have fun, and spend quality time with family or friends. With its diverse water attractions, relaxation areas, and additional services, the park provides a pleasant and entertaining aquatic experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "970639d0-3bc8-4599-b5ca-d35fc9b60a5c", "translation" => "Le parc aquatique Marina d'or est un endroit idéal pour se rafraîchir, s'amuser et passer du bon temps en famille ou entre amis. Avec ses attractions aquatiques variées, ses espaces de détente et ses services complémentaires, le parc offre une expérience aquatique agréable et divertissante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f9ee614c-77d7-4d96-b30c-f0b8463aab8e", "translation" => "الحديقة المائية مارينا دور هي مكان مثالي للتبريد والمرح وقضاء وقت ممتع مع العائلة أو الأصدقاء. بفضل مجموعتها المتنوعة من الألعاب المائية ومناطق الاستراحة والخدمات الإضافية، تقدم الحديقة تجربة مائية ممتعة ومسلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1001
            ["id" => "a2fff22e-2b4a-402f-95e0-ba66849ba01d", "translation" => "The Rmila beach is an ideal place to spend time with family, relax, or simply take a leisurely walk on the sand. With its preserved natural setting and clear waters, this beach offers a relaxing and refreshing experience for visitors of all ages.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c3e799a9-cf40-404f-995c-50c71ce23f49", "translation" => "La plage de Rmila est un endroit idéal pour passer du temps en famille, se détendre ou simplement se promener sur le sable. Avec son cadre naturel préservé et ses eaux claires, cette plage offre une expérience relaxante et rafraîchissante pour les visiteurs de tous âges.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "60845631-9758-44b8-9db8-fb6f22c0764a", "translation" => "شاطئ الرميلة هو مكان مثالي لقضاء وقت مع العائلة، أو الاسترخاء، أو مجرد التجول على الرمال. بفضل موقعه الطبيعي الحافظ ومياهه الواضحة، يقدم هذا الشاطئ تجربة استرخاء ومنعشة للزوار من جميع الأعمار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1002
            ["id" => "a117d056-9617-4389-9048-9aca65f93824", "translation" => "The little port beach is a hidden gem, offering peace and tranquility to those who visit it. Whether it's for sunbathing, enjoying the refreshing waters of the sea, or simply admiring the surrounding landscape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b97829a7-f2c3-47ea-b74f-fb44e4a5fc9d", "translation" => "La plage du petit port est un véritable joyau caché, offrant calme et tranquillité à ceux qui la visitent. Que ce soit pour se relaxer au soleil, profiter des eaux rafraîchissantes de la mer ou simplement admirer le paysage environnant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ce0200f6-82ed-4e1a-be3f-fdf424c0013e", "translation" => "شاطئ الميناء الصغير هو جوهرة مخفية، تقدم السلام والهدوء لأولئك الذين يزورونها. سواء كان الأمر يتعلق بالاستلقاء تحت أشعة الشمس، أو الاستمتاع بمياه البحر المنعشة، أو مجرد التعجب من المناظر الطبيعية المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1003
            ["id" => "63e1d8b2-f34e-4118-9e9d-4b26a47cbcdb", "translation" => "The fishing port of el Marsa is a must-visit for seafood enthusiasts, the curious, and sea lovers. It's a place where you can appreciate the authenticity of maritime life and discover the richness of the marine resources in the Skikda region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6fed73c6-40af-4941-8604-3e8932690ebd", "translation" => "Le port de pêche d'el Marsa est un lieu incontournable pour les amateurs de fruits de mer, les curieux et les amoureux de la mer. C'est un endroit où l'on peut apprécier l'authenticité de la vie maritime et découvrir la richesse des ressources marines de la région de Skikda.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "42fdc79f-e298-44a6-bf03-25b20402fd01", "translation" => "ميناء الصيد في المرسى هو مكان لا بد من زيارته لعشاق المأكولات البحرية والفضوليين وعشاق البحر. إنه مكان حيث يمكنك تقدير أصالة الحياة البحرية واكتشاف ثراء الموارد البحرية في منطقة سكيكدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1004
            ["id" => "75cff807-961f-4ad9-bd46-3eae3a293fde", "translation" => "With an expanse of over 8 kilometers, the Kef Fatma beach is a true paradise for sun, sand, and water enthusiasts. It is bordered to the east by the Oued Kebir, which marks the border with the municipality of el Marsa. The beauty of this beach lies in its vast stretches of fine golden sand, inviting visitors to stroll along the coast and enjoy the fresh sea breeze.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9aec28d1-0575-402a-bc81-d5ef112565d3", "translation" => "Avec une étendue de plus de 8 kilomètres, la plage Kef Fatma est un véritable paradis pour les amateurs de soleil, de sable et d'eau. Elle est bordée à l'est par l'oued Kébir, qui marque la frontière avec la commune d'el Marsa. La beauté de cette plage réside dans ses vastes étendues de sable fin et doré, invitant les visiteurs à se promener le long de la côte et à profiter de l'air marin frais.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "77ac3462-ba90-4309-a898-7531ac2f6f50", "translation" => "بمساحة تزيد عن 8 كيلومترات، يعتبر شاطئ كاف فاطمة جنة حقيقية. يتميز بتخطيطه إلى الشرق من واد كبير، الذي يميز الحدود مع بلدية المرسى. جمال هذا الشاطئ يكمن في مساحاته الشاسعة من الرمال الناعمة والذهبية، مما يجعله يدعو الزوار للتجول على طول الساحل والاستمتاع بنسمات الهواء البحري العليلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1005
            ["id" => "1969330e-345f-4cef-94fd-1886ffa7ebde", "translation" => "Whether for swimming, sunbathing, strolling, or simply enjoying the natural beauty, the Guerbaz beach provides an ideal setting to escape the daily routine and rejuvenate in harmony with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "03e5cb24-8491-48b6-be06-9f6a8df7cc64", "translation" => "Que ce soit pour se baigner, bronzer, se promener ou simplement profiter de la beauté naturelle, la plage Guerbaz offre un cadre idéal pour échapper au quotidien et se ressourcer en harmonie avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7e2ea5e8-d3bb-4fd7-92f7-ed1b96d5e1a6", "translation" => "سواء كنت ترغب في السباحة أو التشمس أو التجول أو مجرد الاستمتاع بالجمال الطبيعي، يقدم شاطئ ڨرباز إعدادًا مثاليًا للهروب من الروتين اليومي والتجدد في انسجام مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1006
            ["id" => "5675233f-f270-4ea0-9412-ab53dd51a228", "translation" => "This Maltese cargo ship met a tragic fate when it ran aground on the night of March 6, 2008, around 11:35 PM. Since then, the wreck of the vessel Sophia has become a point of interest for curious visitors. The imposing carcass of the stranded cargo ship stands as a poignant reminder of the forces of nature and the dangers that the sea can pose.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f7284e4d-5733-4ec7-bcf1-5b13ad8090e6", "translation" => "Ce cargo maltais a connu un triste destin lorsqu'il s'est échoué dans la nuit du 6 mars 2008, vers 23h35.Depuis lors, l'épave du navire Sophia est devenue un point d'intérêt pour les visiteurs curieux. L'imposante carcasse du cargo échoué se dresse comme un rappel poignant des forces de la nature et des dangers que peut représenter la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e6543b5c-5455-47b9-8be9-375350de7f01", "translation" => "هذا السفينة التجارية المالطية قد واجهت مصيرًا مأساويًا عندما اصطدمت بالشاطئ في ليلة 6 مارس 2008، حوالي الساعة 11:35 مساءً. منذ ذلك الحين، أصبحت حطام سفينة صوفيا نقطة جذب للزوار الفضوليين. تقف الجثة الضخمة للسفينة التجارية المعلقة على الشاطئ كتذكير مؤثر بقوى الطبيعة والمخاطر التي يمكن أن تشكلها البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1007
            ["id" => "833abe77-57a2-4b85-9f34-25fda1052fa4", "translation" => "The Oued Saboun beach is a true seaside paradise where nature harmoniously blends with the tranquility and beauty of the coastline. Whether you want to relax, have fun, or reconnect with nature, this beach offers an unforgettable experience to all who visit.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e91453dc-6e14-4e3e-ac39-8374063305b0", "translation" => "La plage d'Oued Saboun est un véritable paradis balnéaire où la nature se mêle harmonieusement à la tranquillité et à la beauté du littoral. Que ce soit pour se détendre, se divertir ou se reconnecter avec la nature, cette plage offre une expérience inoubliable à tous ceux qui la visitent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "abb5cbf1-2fbf-4ea1-9d2b-8118601451be", "translation" => "شاطئ واد الصابون هو جنة ساحلية حقيقية حيث تتداخل الطبيعة بانسجام مع هدوء وجمال الساحل. سواء كنت ترغب في الاسترخاء أو التسلية أو إعادة الاتصال بالطبيعة، يقدم هذا الشاطئ تجربة لا تُنسى لجميع الذين يزورونه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1008
            ["id" => "bff36e63-13fa-4b61-b2df-1812d9580069", "translation" => "Whether for relaxation, swimming, or simply enjoying the natural beauty, the Oued Righa beach is a must-visit place in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "20ed8359-f81e-4f13-ba09-664ee95c1816", "translation" => "Que ce soit pour se détendre, nager ou simplement profiter de la beauté naturelle, la plage d'Oued Righa est un endroit incontournable de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "225d0c46-64f3-42f7-9b63-1e2372846834", "translation" => "سواءً كنت تبحث عن الاسترخاء أو السباحة أو مجرد الاستمتاع بالجمال الطبيعي، شاطئ واد ريغة هو مكان لا بد من زيارته في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1009
            ["id" => "6110e009-4b94-4119-965a-1fbb67d31d47", "translation" => "Whether you're looking for a day of pool swimming, relaxation on the beach, or a combination of both, the Joan of Arc pool provides a great aquatic leisure concept with efficient management. Visitors can choose the option that suits them best and enjoy a pleasant and refreshing time in Skikda.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d729fe5a-e9a6-4d5a-9021-b3bf0bd43e7a", "translation" => "Que ce soit pour une journée de baignade en piscine, une détente sur la plage ou une combinaison des deux, la piscine Jeanne d'Arc offre un bon concept de loisirs aquatiques avec une gestion efficace. Les visiteurs peuvent ainsi choisir l'option qui leur convient le mieux et passer un moment agréable et rafraîchissant à Skikda.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f7f5c6e4-1a2a-4684-98df-68dac7f522c7", "translation" => "سواء كنت تبحث عن يوم في المسبح أو الاسترخاء على الشاطئ أو مزيج من الاثنين، يقدم مسبح جان دارك فكرة رائعة لأوقات الترفيه المائي مع إدارة فعالة. يمكن للزوار اختيار الخيار الذي يناسبهم أفضل والاستمتاع بوقت ممتع ومنعش في سكيكدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1010
            ["id" => "ca211313-55a5-4551-85ac-2ccd31e2ce7a", "translation" => "The Mraissa beach is an isolated and hard-to-reach destination, offering visitors the opportunity to enjoy breathtaking natural beauty, fascinating caves, and absolute tranquility. It's a true paradise for those seeking to escape and connect with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e8302a87-3da7-4b62-a266-3a7237fc4845", "translation" => "La plage Mraïssa est une destination isolée et difficile d'accès, offrant aux visiteurs la possibilité de profiter d'une beauté naturelle époustouflante, de grottes fascinantes et d'une tranquillité absolue. C'est un véritable paradis pour ceux qui cherchent à s'évader et à se connecter avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8bc5cb99-1b8c-46ff-88de-ed175d359c30", "translation" => "شاطئ المريسة هو وجهة معزولة وصعبة الوصول، تقدم للزوار فرصة الاستمتاع بجمال طبيعي رائع، وكهوف مذهلة، وهدوء مطلق. إنها جنة حقيقية لأولئك الذين يبحثون عن الهروب والاتصال مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1011
            ["id" => "3c7b1f5d-4ef9-462d-81c4-c1920ab7e9ba", "translation" => "The Larbi ben Mhidi beach is a beautiful stretch of sand that attracts visitors with its natural beauty and pleasant atmosphere. It provides an ideal setting for relaxation, swimming, and enjoying the sun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "34d54b1b-1186-4abb-aa34-a8257c7fa853", "translation" => "La plage Larbi ben Mhidi est une magnifique étendue de sable qui attire les visiteurs par sa beauté naturelle et son ambiance agréable. Elle offre un cadre idéal pour se détendre, se baigner et profiter du soleil.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "91220f13-3860-4c84-8b23-cfd3ec7d15c5", "translation" => "شاطئ العربي بن مهيدي هو ممتد رملي جميل يجذب الزوار بجماله الطبيعي وجوه الممتع. إنه يوفر إعدادًا مثاليًا للاسترخاء والسباحة والاستمتاع بالشمس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1012
            ["id" => "db499e64-b9b2-43f0-8818-0e17e540e2de", "translation" => "The Bab Constantine garden is a charming green space that provides a peaceful refuge in the heart of the city. This garden is a relaxing place cherished by the locals and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "30efa9d3-1b23-4999-9278-d676889103d5", "translation" => "Le jardin Bab Constantine est un charmant espace vert qui offre un refuge paisible au cœur de la ville. Ce jardin est un lieu de détente apprécié par les habitants et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b3433499-0695-424d-98cc-43035e3d869e", "translation" => "حديقة باب قسنطينة هي مساحة خضراء ساحرة تقدم مأوىًا هادئًا في قلب المدينة. تعتبر هذه الحديقة مكانًا للاسترخاء يحظى بتقدير السكان المحليين والزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1013
            ["id" => "6d6d71b5-a452-4934-9b3f-beeaeb917399", "translation" => "The Calatines beach is a hidden gem, providing visitors with a unique and secluded experience. Nestled between imposing and hard-to-reach cliffs, this beach is a haven of tranquility and natural beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9fa11ba8-81d0-4f9f-b5a5-30e1a2780c19", "translation" => "La plage des Calatines est un véritable trésor caché, offrant aux visiteurs une expérience unique et isolée. Nichée entre des falaises imposantes et difficilement accessibles, cette plage est un havre de tranquillité et de beauté naturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4eb128d9-3ab4-4ceb-aacf-ac1b4f4a7397", "translation" => "شاطئ ليكالاتين كنز مخفي حقيقي، يقدم للزوار تجربة فريدة ومنعزلة. محاط بين جدران صخرية ضخمة وصعبة الوصول، يعتبر هذا الشاطئ ملاذًا للهدوء والجمال الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1014
            ["id" => "4bb9e737-5a36-4abf-8912-92e4579976e3", "translation" => "The quarry beach is an enchanting place where visitors can enjoy golden sands, clear waters, and a relaxing atmosphere. It's an ideal spot for relaxation, swimming, and family or friends' entertainment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ef65c0f9-cd2a-48cb-b750-d8ab80b63fdb", "translation" => "La plage de la carrière est un lieu enchanteur où les visiteurs peuvent profiter du sable doré, des eaux claires et d'une atmosphère relaxante. C'est un endroit idéal pour se détendre, se baigner et se divertir en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "60b75751-53f5-4f4d-9679-239fb27e7a9d", "translation" => "شاطئ المحجرة هو مكان ساحر حيث يمكن للزوار الاستمتاع بالرمال الذهبية والمياه الصافية وجو هادئ. إنه مكان مثالي للاسترخاء والسباحة والتسلية مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1015
            ["id" => "fbca0b63-7d24-4e80-b16f-f567e9dd0431", "translation" => "Its clear waters, fine sand, and enchanting setting make it a place of relaxation and enjoyment for both residents and visitors seeking unforgettable moments by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7fe11f5a-d2eb-4e28-b9b0-3027e446cd6d", "translation" => "Ses eaux claires, son sable fin et son cadre enchanteur en font un lieu de détente et de plaisir pour les habitants et les visiteurs en quête de moments inoubliables au bord de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c2667477-ae3f-4e58-a725-c52283f0b656", "translation" => "مياهه الصافية، ورماله الناعمة، وإعداده الساحر يجعلونه مكانًا للراحة والتمتع للسكان والزوار على حد سواء الذين يبحثون عن لحظات لا تُنسى على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1016
            ["id" => "99a01cb7-7753-44a9-8976-f292d09f6bc9", "translation" => "Whether it's for swimming, relaxing on the warm sand, or engaging in water activities, this beach offers a pleasant seaside experience for everyone.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1d4ac05e-1773-453f-90cc-67b0bbfa9fb7", "translation" => "Que ce soit pour se baigner, se détendre sur le sable chaud ou s'adonner à des activités nautiques, cette plage offre une expérience balnéaire agréable pour tous.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "088d5cf6-bde5-4547-94bf-4a5ad8e907ef", "translation" => "سواء كان الأمر يتعلق بالسباحة، أو الاسترخاء على الرمال الدافئة، أو ممارسة الأنشطة المائية، تقدم هذه الشاطئ تجربة ساحلية ممتعة للجميع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1017
            ["id" => "438a4ee6-008b-42e9-b87e-9a34a8c33d41", "translation" => "The Paradise beach stands out with its fine golden sand, crystal-clear waters, and lively atmosphere. It is ideal for swimmers of all ages, with its shallow waters and gentle waves.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ad4950ba-743e-4430-b1bb-81479340fc82", "translation" => "La plage Paradis se distingue par son sable fin et doré, ses eaux cristallines et son ambiance animée. Elle est idéale pour les baigneurs de tous âges, avec ses eaux peu profondes et ses vagues douces.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "95326906-8f34-442f-9b23-724a344402aa", "translation" => "شاطئ الجنة يتميز برماله الرقيقة والذهبية، ومياهه الصافية والأجواء النابضة بالحياة. إنه مثالي للسباحين من جميع الأعمار، بفضل مياهه الضحلة وأمواجه اللطيفة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1018
            ["id" => "b1048065-defb-443b-affa-67cab25d5926", "translation" => "The Marquette beach offers a pleasant experience with its excellent panoramic view and peaceful atmosphere. It is an ideal place for families and children, providing a safe and relaxing environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "504f617f-d55e-4f90-8a1d-50ba6de4d1da", "translation" => "La plage Marquette offre une expérience agréable avec son excellente vue panoramique et son atmosphère paisible. C'est un lieu idéal pour les familles et les enfants, offrant un environnement sûr et propice à la détente.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f5884560-5164-413d-b4de-b9427d7a2a69", "translation" => "شاطئ ماركات يقدم تجربة لطيفة مع إطلالته الممتازة على المناظر الطبيعية وجوه السلام. إنه مكان مثالي للعائلات والأطفال، حيث يوفر بيئة آمنة ومريحة للاسترخا", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1019
            ["id" => "23b946d8-3f42-4253-87f7-03d16dff45d3", "translation" => "This beach is favored by families because it provides a pleasant setting and doesn't require taking a bus or another mode of transportation to get there. However, it's worth noting that, although it doesn't receive significant waste or pollution, it is adjacent to the pier, which is unfortunately contaminated.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5028ec8b-24af-4980-8ada-0a99b93fa3ed", "translation" => "Cette plage est appréciée des familles, car elle offre un cadre agréable et n'exige pas de prendre un bus ou un autre moyen de transport pour s'y rendre. Cependant, il convient de noter que bien qu'elle ne reçoive pas de déchets ou de rejets importants, elle est voisine de la jetée, qui est malheureusement polluée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "db9082ee-a92b-48a2-83b7-187031a43d40", "translation" => "هذا الشاطئ محبب للعائلات لأنه يوفر بيئة لطيفة ولا يتطلب الحاجة إلى ركوب الحافلة أو وسيلة نقل أخرى للوصول إليه. ومع ذلك، يجدر بالذكر أنه على الرغم من عدم تلقيه كميات كبيرة من النفايات أو التلوث، إلا أنه متجاور للرصيف البحري، والذي للأسف ملوث.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1020
            ["id" => "ebaa743a-4b9c-4d45-a066-765c129ac89a", "translation" => "Whether you're an experienced rider or just looking to get started with horseback riding, the Skikda equestrian center is the perfect place to create memorable moments in the company of horses.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d351c352-f538-47e0-b176-e6af87dc7d94", "translation" => "Que vous soyez un cavalier chevronné ou que vous souhaitiez simplement vous initier à l'équitation, le centre équestre de Skikda est l'endroit idéal pour vivre des moments mémorables en compagnie des chevaux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "34913058-7e0e-4e5f-9617-7993c68e2bec", "translation" => "سواء كنت فارسًا ماهرًا أم ترغب فقط في البدء في ركوب الخيل، فإن مركز سكيكدة للفروسية هو المكان المثالي لقضاء لحظات لا تُنسى برفقة الخيول.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1021
            ["id" => "206e4ab9-452a-4360-9a16-4ee6cc818012", "translation" => "The Oued Bibi beach offers a preserved natural setting and a tranquil atmosphere, ideal for nature enthusiasts seeking a secluded and peaceful place to relax and rejuvenate.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "efd68036-3dc4-4d53-ba16-154180e5d552", "translation" => "La plage Oued Bibi offre un cadre naturel préservé et une atmosphère tranquille, idéale pour les amateurs de nature à la recherche d'un lieu isolé et paisible pour se détendre et se ressourcer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b1175e41-34b2-4ce7-bc80-2b31a51e1b02", "translation" => "شاطئ واد بيبي يقدم إطارًا طبيعيًا محتفظًا به وجوًا هادئًا، مثاليًا لعشاق الطبيعة الذين يبحثون عن مكان منعزل وهادئ للاسترخاء والاستجمام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1022
            ["id" => "535f9d24-aae9-4cc9-af7e-a962feba080e", "translation" => "The big beach stands out for its generous size, white sand, and natural setting surrounded by green fields and imposing mountains. As the only beach in the municipality where swimming is allowed and secured, it attracts a large number of visitors seeking relaxation, swimming, and enjoyable moments by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "03a9c022-b4c5-4ae2-a5a9-72f83a8b145d", "translation" => "La grande plage se distingue par sa taille généreuse, son sable blanc et son cadre naturel entouré de champs verdoyants et de montagnes imposantes. En tant que seule plage de la commune où la baignade est autorisée et sécurisée, elle attire un grand nombre de visiteurs en quête de détente, de baignade et de moments agréables au bord de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9e85271d-c14f-4e72-a17e-d122643ba8c6", "translation" => "الشاطئ الكبير يتميز بحجمه السخي، والرمال البيضاء، والإطار الطبيعي المحاط بحقول خضراء وجبال شاهقة. بوصفه الشاطئ الوحيد في البلدية حيث يُسمح بالسباحة ويتم تأمينها، يجذب عددًا كبيرًا من الزوار الذين يبحثون عن الاسترخاء والسباحة ولحظات ممتعة على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1023
            ["id" => "85fb357c-56c0-4b24-b3bb-f4c58bc16940", "translation" => "Oued Tanger beach offers a preserved natural environment surrounded by forested mountains and is ideal for those seeking a secluded and peaceful beach away from the crowd.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a36aec45-55b4-46e9-8a10-c6268a038fc8", "translation" => "La plage de Oued Tanger offre un environnement naturel préservé, entouré de montagnes forestières, et est idéale pour ceux qui recherchent une plage isolée et paisible loin de la foule.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9980ecce-13e9-4cb2-b5c5-5682da4507d1", "translation" => "شاطئ واد طنجة يوفر بيئة طبيعية محفوظة، محاطة بجبال مغطاة بالغابات، وهو مثالي لأولئك الذين يبحثون عن شاطئ منعزل وهادئ بعيدًا عن الزحام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1024
            ["id" => "c2162080-d6e5-45ce-a308-8b187b184918", "translation" => "The Ben Zouit beach is a true natural gem offering an idyllic setting for relaxation, swimming, and enjoying the pleasures of the sea. Its tranquil atmosphere and preserved environment make it a favorite spot for nature lovers and those seeking peace and natural beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2845c014-905b-4466-90d1-1b3978faec84", "translation" => "La plage de Ben Zouit est un véritable joyau naturel offrant un cadre idyllique pour se détendre, se baigner et profiter des plaisirs de la mer. Son ambiance tranquille et son environnement préservé en font un lieu de prédilection pour les amoureux de la nature et ceux en quête de calme et de beauté naturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "58883810-39d9-470b-8e4e-efbddcff7f5e", "translation" => "شاطئ بن زويت هو جوهرة طبيعية حقيقية تقدم إعدادًا خياليًا للاسترخاء والسباحة والاستمتاع بلذائذ البحر. جوهرته الهادئة وبيئته المحفوظة تجعله مكانًا مفضلًا لعشاق الطبيعة وأولئك الذين يبحثون عن السلام والجمال الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1025
            ["id" => "eeab70f6-20cc-4f5b-858f-323d50d0ecc7", "translation" => "The Zakour Kerkera beach offers a unique experience for adventurers willing to take on the challenge of its difficult access. It is a preserved place where one can rejuvenate in harmony with nature and enjoy nearly untouched natural beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5e5d5229-6f16-4a4d-90a2-96ec19077219", "translation" => "La plage Zakour Kerkera offre une expérience unique pour les aventuriers qui sont prêts à relever le défi de son accès difficile. C'est un lieu préservé où l'on peut se ressourcer en harmonie avec la nature et profiter d'une beauté naturelle quasi intacte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3092a6ce-7186-4058-9399-43feb51e8ad3", "translation" => "شاطئ زقور كركرة يقدم تجربة فريدة للمغامرين الذين مستعدون لتحدي الوصول الصعب. إنه مكان محفوظ حيث يمكن للزائرين أن يتجددوا في وئام مع الطبيعة ويستمتعوا بجمال طبيعي تقريبًا لم يتأثر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1026
            ["id" => "639d0e21-5d8d-4b2e-b108-4ad7008deb36", "translation" => "The Roman Palace beach offers a unique blend of natural beauty and historical richness. Visitors can enjoy the charm of this beach while exploring the remains of an ancient, likely Roman structure, all while relaxing and rejuvenating by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a7de4582-0536-4c08-a9ee-8c37379eda61", "translation" => "La plage du Palais Romain à offre une combinaison unique de beauté naturelle et de richesse historique. Les visiteurs peuvent profiter du charme de cette plage en découvrant les vestiges d'une ancienne bâtisse probablement romaine, tout en se relaxant et en se ressourçant au bord de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "78f6d6b3-3b68-444e-8095-568b6600678c", "translation" => "شاطئ القصر الروماني يقدم مزيجًا فريدًا من الجمال الطبيعي والثراء التاريخي. يمكن للزوار الاستمتاع بسحر هذا الشاطئ بالاطلاع على آثار هيكل قديم ربما يكون رومانيًا، وذلك بينما يسترخون على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1027
            ["id" => "5a6e5c92-a872-4d9f-8581-5e73806a4ef7", "translation" => "The Taleza beach is a top destination for those seeking tranquility, offering a preserved natural setting and breathtaking panoramas. It's the perfect place to relax, rejuvenate, and enjoy the beauty of the surrounding nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a293f9f1-34b3-4534-a8f2-1dea4b99c4fd", "translation" => "La plage de Taleza est une destination de choix pour les amateurs de tranquillité, offrant un cadre naturel préservé et des panoramas à couper le souffle. C'est l'endroit idéal pour se détendre, se ressourcer et profiter de la beauté de la nature environnante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bf8b9643-1480-45c6-bb57-aeea2db21aed", "translation" => "شاطئ تلزة هو وجهة مثالية لعشاق الهدوء، حيث يقدم إعداداً طبيعياً محفوظاً ومناظر خلابة تأسر الألباب. إنه المكان المثالي للاسترخاء واستعادة النشاط والاستمتاع بجمال الطبيعة المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1028
            ["id" => "f00a184e-414f-4f05-bdae-09ac9c42971e", "translation" => "The beach stretches over a considerable distance, providing visitors with ample space to enjoy the fine sand and clear waters. The Ksir el Baz beach offers a true haven of peace away from the hustle and bustle of everyday life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e66fb768-4f25-4b30-912d-f2c35c6340b2", "translation" => "La plage s'étend sur une distance considérable, offrant aux visiteurs un vaste espace pour profiter du sable fin et des eaux claires. La plage de Ksir el Baz offre un véritable havre de paix loin de l'agitation de la vie quotidienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6e109dd5-a793-4d3a-9341-6fbf301ec1d8", "translation" => "الشاطئ يمتد على مسافة كبيرة، مما يوفر للزوار مساحة واسعة للاستمتاع بالرمال الناعمة والمياه الصافية. شاطئ كسير الباز يقدم ملاذًا حقيقيًا للسلام بعيدًا عن صخب الحياة اليومية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1029
            ["id" => "6a6fb4f3-fbcb-49e9-9ff6-1885d460d623", "translation" => "In addition to its economic aspect, the Collo fishing port also offers a picturesque setting, with colorful boats gently swaying to the rhythm of the waves and stunning coastal landscapes in the background. It's an ideal place for a leisurely walk along the pier, observing the fishermen's activities, and enjoying the authentic maritime atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fe3468f3-b626-476c-b314-cf7f9c0941e6", "translation" => "En plus de son aspect économique, le port de pêche de Collo offre également un cadre pittoresque, avec les bateaux colorés qui se balancent doucement au rythme des vagues et les magnifiques paysages côtiers en arrière-plan. C'est un endroit idéal pour se promener le long de la jetée, observer les activités des pêcheurs et profiter de l'atmosphère maritime authentique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f4335248-2b69-452a-a0c4-800557e75a40", "translation" => "بالإضافة إلى جوانبه الاقتصادية، يقدم ميناء الصيد في القل أيضًا إطارًا جميلًا، حيث تتأرجح القوارب الملونة برفق وفق إيقاع الأمواج والمناظر الساحلية الرائعة في الخلفية. إنه مكان مثالي للتجول ببطء على طول الرصيف، ومراقبة أنشطة الصيادين، والاستمتاع بالأجواء البحرية الأصيلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1030
            ["id" => "b7a65e2a-2bb9-4e70-8fe3-86d128dfca90", "translation" => "This beach offers a beautiful landscape and clear waters that attract many visitors in search of relaxation and tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "85ff9d89-be70-45f0-ac01-24e92f29f16c", "translation" => "Cette plage offre un paysage magnifique et des eaux claires qui attirent de nombreux visiteurs à la recherche de détente et de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "67dfe422-4a59-4965-9c39-f521d488abe5", "translation" => "هذا الشاطئ يقدم مناظر خلابة ومياه واضحة تجذب العديد من الزوار الباحثين عن الاسترخاء والسلام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1031
            ["id" => "d9e60a1d-7c79-4d46-a756-016621ad19d5", "translation" => "This secluded beach offers a preserved natural setting and breathtaking landscapes, but its access is difficult and requires some exploration.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "caff4676-3b91-461d-9d15-595805801e80", "translation" => "Cette plage isolée offre un cadre naturel préservé et des paysages à couper le souffle, mais son accès est difficile et nécessite une certaine exploration.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "69c0e1ff-3c44-4471-b78a-0c0aa2d70609", "translation" => "هذا الشاطئ النائي يقدم إعدادًا طبيعيًا محفوظًا ومناظر خلابة، ولكن الوصول إليه صعب ويتطلب بعض الاستكشاف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1032
            ["id" => "c24aad36-195c-4485-afa4-a8bda7b55064", "translation" => "This garden is a beautiful green space that provides a touch of tranquility within the city. It is a place of relaxation and leisure for the residents and visitors of Collo.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7eaa144d-477c-41d1-9764-d216af75e237", "translation" => "Ce jardin est un espace vert magnifique qui offre un brin de tranquillité au sein de la ville. C' est un lieu de détente et de loisirs pour les habitants et les visiteurs de Collo.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e424be96-f48f-4f02-8e19-f2178a63e5f4", "translation" => "هذه الحديقة هي مساحة خضراء جميلة توفر لمسة من الهدوء داخل المدينة. إنها مكان للاسترخاء والترفيه لسكان القل والزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1033
            ["id" => "df82fe6d-e6ab-4281-be4b-4174662a3cad", "translation" => "Today, the colonial army's torture center in Collo is a place steeped in history, bearing witness to the atrocities committed during that dark period. It serves as a reminder of the struggle for justice, dignity, and freedom.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8f65a259-eeae-47bd-97a8-70e430fec9ad", "translation" => "Aujourd'hui, le centre de torture de l'armée coloniale à Collo est un lieu chargé d'histoire, témoignant des atrocités commises pendant cette période sombre. Il rappelle la lutte pour la justice, la dignité et la liberté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c41b23e1-6e2a-4b88-8099-d850dbab8ae4", "translation" => "اليوم، مركز التعذيب التابع للجيش الاستعماري في القل هو مكان محمل بالتاريخ، يشهد على الفظائع التي ارتكبت خلال تلك الفترة المظلمة. إنه يذكرنا بالنضال من أجل العدالة والكرامة والحرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1034
            ["id" => "68da138b-a9b6-480c-8540-7102fff9d149", "translation" => "The Bougaroune lighthouse is a historical gem that embodies the evolution of coastal lighting in the region. Dating back to the French colonial era, this lighthouse offers a unique experience to visitors in search of maritime history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ab213ec1-a26a-4098-83fb-a67885efb580", "translation" => "Le phare de Bougaroune est un joyau historique qui incarne l'évolution de l'éclairage côtier dans la région. Remontant à l'époque coloniale française, ce phare offre une expérience unique aux visiteurs en quête d'histoire maritime.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "15007b27-90b9-4ad4-ba3e-8f6a51cb90f1", "translation" => "منارة بوقارون هي جوهرة تاريخية تجسد تطور الإضاءة الساحلية في المنطقة. يعود تاريخها إلى العصر الاستعماري الفرنسي، وهذه المنارة تقدم تجربة فريدة للزوار الذين يبحثون عن تاريخ البحرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1035
            ["id" => "4b839b25-4324-45e5-9084-5869bed47f18", "translation" => "If you're looking for a unique and off-the-beaten-path experience, the Bounchem beach is the perfect place for you. Discover the raw beauty of this secluded beach and be captivated by its tranquil and preserved atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5442428d-35a4-426a-a158-d1ad71a09a42", "translation" => "Si vous recherchez une expérience unique et hors des sentiers battus, la plage de Bounchem est l'endroit parfait pour vous. Découvrez la beauté brute de cette plage isolée et laissez-vous séduire par son ambiance tranquille et préservée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5412cd1a-2451-4f93-adf7-c30bd8e6c237", "translation" => "إذا كنت تبحث عن تجربة فريدة ومختلفة عن المعتاد، فإن شاطئ بونشم هو المكان المثالي لك. اكتشف جمال هذا الشاطئ النائي واترك نفسك تتأمل في أجوائه الهادئة والمحفوظة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1036
            ["id" => "8b304499-c4f3-4fea-9350-f97a129e44c1", "translation" => "It is worth noting that the challenging access to this beach adds to its charm and preserves its wild character. It is recommended to be well-prepared and take necessary precautions during your visit.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "90b95108-c09d-465f-ab7a-05bac29182fe", "translation" => "Il convient de noter que la difficulté d'accès à cette plage ajoute à son charme et préserve son caractère sauvage. Il est recommandé d'être bien préparé et de prendre les précautions nécessaires lors de votre visite.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0e3aa9bb-fcdc-4bf4-afc4-5c2555bd8365", "translation" => "من الجدير بالذكر أن صعوبة الوصول إلى هذا الشاطئ تضيف إلى سحره وتحافظ على طابعه البري. يُوصَى بأن تكون مستعدًا جيدًا وتتخذ الاحتياطات اللازمة أثناء زيارتك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1037
            ["id" => "fee45bad-58af-422c-990e-de25e52f7a8d", "translation" => "The rocky beach of Damous is known for its secluded and peaceful nature. Due to its challenging access, it is often less crowded, providing visitors with unparalleled tranquility. It is the perfect place to escape the hustle and bustle of daily life and connect with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7eb7992e-6167-446f-864d-28adf72d189f", "translation" => "La plage rocheuse de Damous est réputée pour son caractère isolé et paisible. En raison de sa difficulté d'accès, elle est souvent moins fréquentée, offrant ainsi aux visiteurs une tranquillité inégalée. C'est l'endroit idéal pour échapper à l'agitation de la vie quotidienne et se connecter avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f93ccedb-6ad0-460b-8216-8607110ced64", "translation" => "الشاطئ الصخري الداموس مشهور بطابعه النائي والهادئ. بسبب صعوبة الوصول إليه، فإنه غالبًا ما يكون أقل ازدحامًا، مما يوفر للزوار هدوءًا لا مثيل له. إنه المكان المثالي للهروب من صخب الحياة اليومية والتواصل مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1038
            ["id" => "55c715f5-812c-4d57-a7f0-3a7f79b620af", "translation" => "The Marsa Zitoun beach is only accessible via a challenging, hardly passable track. It is among the most beautiful and popular in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "44baab58-d5e6-471c-b5bc-f55b64378443", "translation" => "La plage Marsa Zitoun est accessible uniquement par une piste difficilement praticable. Elle compte parmi les plus belles et les plus prisées de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "18f933e4-fcb9-4ccc-9227-b900a1196e03", "translation" => "شاطئ مرسى الزيتون يمكن الوصول إليه فقط عبر مسار صعب السير. إنه من بين أجمل وأكثر الشواطئ شهرة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1039
            ["id" => "95b6a452-7a2b-4594-8b6a-f62ea9e1f49e", "translation" => "Let yourself be captivated by the splendor of Khraief beach, where the gentle murmur of the waves blends with the songs of birds. It's an ideal place to relax, rejuvenate, and connect with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d3113f4b-26a3-4654-b6dc-1e707ca73ba3", "translation" => "Laissez-vous séduire par la splendeur de la plage Khraief, où le doux murmure des vagues se mêle aux chants des oiseaux. C'est un lieu idéal pour se détendre, se ressourcer et se connecter avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fa085bb0-6d85-4cef-bb2e-744eddf6462f", "translation" => "دع نفسك تسحر بروعة شاطئ الخرايف, حيث يمتزج همس الأمواج اللطيفة مع أنغام الطيور. إنه المكان المثالي للاسترخاء واستعادة نشاطك والتواصل مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1040
            ["id" => "e3778986-8711-4392-ba2e-71da8a9f77f9", "translation" => "Whether you're a beach lover, a hiking enthusiast, or simply seeking tranquility, this beach will fulfill you with its beauty and soothing atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "40775f0f-f735-407d-9a80-1fdf6b092271", "translation" => "Que vous soyez un amateur de plage, un adepte de randonnée ou simplement en quête de tranquillité, cette plage vous comblera par sa beauté et son atmosphère apaisante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2f0e79b7-c766-4463-9a6f-ae19f222840e", "translation" => "سواء كنت عاشقًا للشواطئ، أو عاشقًا للمشي في الطبيعة، أو مجرد من يبحث عن الهدوء، فإن هذا الشاطئ سيروق لك بجماله وجوه السكينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1041
            ["id" => "15e346bd-e720-4998-a4af-1aa0a5183dae", "translation" => "The Kheneg Mayoum recreational forest is a true haven of peace and entertainment in the heart of nature. This beautiful forest offers a variety of recreational activities for children, making it a beloved relaxation spot for both residents and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "86d6757c-0a65-4b0e-9c8b-0d0576943eff", "translation" => "La forêt récréative Kheneg Mayoum est un véritable havre de paix et de divertissement au cœur de la nature. Cette magnifique forêt offre une variété de jeux récréatifs pour les petits, il est ainsi un lieu de détente prisé par les habitants et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "21d817ae-6174-4b5a-8393-f40f24cb813b", "translation" => "غابة الاستجمام خناق مايون هي ملاذ حقيقي للسلام والترفيه في قلب الطبيعة. تقدم هذه الغابة الجميلة مجموعة متنوعة من الألعاب الترفيهية للأطفال، مما يجعلها مكانًا محبوبًا للسكان والزوار على حد سواء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1042
            ["id" => "673bc4b8-4f8c-4917-a79b-a97949618aba", "translation" => "Whether you're looking for a place to rejuvenate, take a leisurely stroll, or simply enjoy nature, this garden is the perfect place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dfda8a2f-9d64-4202-b564-21b31e7aa1ee", "translation" => "Que vous cherchiez un endroit pour vous ressourcer, faire une promenade tranquille ou simplement profiter de la nature, ce jardin est l'endroit idéal.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d738b140-7c0e-43f1-8080-5ae7ebc5acb2", "translation" => "سواء كنت تبحث عن مكان للاسترخاء، أو للقيام بجولة هادئة، أو ببساطة للاستمتاع بالطبيعة، هذه الحديقة هو المكان المثالي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1043
            ["id" => "b49f9980-0bfc-4546-948c-f435c2fb97d8", "translation" => "Whether you're a nature lover, a photography enthusiast, or simply looking for a relaxing getaway, the Bekkouch Lakhdar dam offers you an unforgettable experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dc05bad9-0022-4ca1-b62b-ba3ef0fca06d", "translation" => "Que vous soyez un amoureux de la nature, un passionné de photographie ou simplement à la recherche d'une escapade relaxante, le barrage de Bekkouch Lakhdar vous offre une expérience inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6496d373-2d75-49e1-9c7f-e7374bceec04", "translation" => "سواء كنت عاشقًا للطبيعة، أو عاشقًا للتصوير الفوتوغرافي، أو مجردًا تبحث عن إجازة مريحة، سد بكوش لخضر يقدم لك تجربة لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1044
            ["id" => "23d9fe26-5b36-48e6-842f-095fb4f0d1bf", "translation" => "The martyr's memorial in Bouchtata is a memorial that pays tribute to the heroes and martyrs who sacrificed their lives for Algeria's independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9ca70842-51ac-4bb4-82c9-25f52542671d", "translation" => "Le Mémorial du Martyr à Bouchtata est un lieu de mémoire qui rend hommage aux héros et martyrs qui ont sacrifié leur vie pour l'indépendance de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1280ef0f-a3ff-41a1-ab73-7f0391b809ed", "translation" => "مقام الشهيد في بوشطاطة هو مكان تذكاري يكرم الأبطال والشهداء الذين قدموا تضحياتهم من أجل استقلال الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1045
            ["id" => "ae01b214-b518-48b9-a17d-3375d97af031", "translation" => "While the journey is considered a challenge, prepare for an immersive getaway and recharge your batteries in the heart of this enchanting forest. The Zmamria waterfalls await you, ready to offer moments of relaxation, adventure, and connection with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d6e9b19e-7b08-45d5-8326-5a618999eea2", "translation" => "Bien que le parcours soit considéré comme un défi, préparez-vous à une escapade immersive et rechargez vos batteries au cœur de cette forêt enchanteresse. Les chutes de Zmamria vous attendent, prêtes à vous offrir des moments de détente, d'aventure et de connexion avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4b51c5b6-6da6-4a1a-bbd0-261d40a82973", "translation" => "على الرغم من أن المسار يُعتبر تحديًا، إعداد نفسك لقضاء إجازة غامرة وشحن طاقتك في قلب هذه الغابة الساحرة. شلالات الزمامرية بانتظارك، جاهزة لتقديم لحظات من الاسترخاء والمغامرة والتواصل مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1046
            ["id" => "03547caa-b888-4112-ad1a-15e21c030233", "translation" => "The Beni Zid dam offers a magnificent view of the coast. This place is synonymous with tranquility, calmness, and ideal relaxation. Hikers will be delighted by the beauty of the surroundings, providing excellent opportunities for walks.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "eea7bdd3-cba6-4cd4-90f4-81a7d43b6be2", "translation" => "Le barrage de Beni Zid offre une vue magnifique sur la côte. Cet endroit est synonyme de tranquillité, de calme et de repos idéal. Les randonneurs seront comblés par la beauté des environs, offrant de belles opportunités de balades.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fd73defd-2cec-426b-a587-02a5a93da1be", "translation" => "سد بني زيد يوفر منظرًا رائعًا للساحل. هذا المكان يرمز إلى الهدوء والسكينة والاستراحة المثالية. سيكون المتنزهون مسرورين بجمال المحيط، مما يوفر فرصًا رائعة للمشي والتجول.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1047
            ["id" => "db933f65-56a9-4eac-a500-898823904988", "translation" => "Whether you're a nature lover, an adventure-hungry hiker, or simply seeking a haven of peace, the Kheneg Mayoum waterfall is the perfect place for a revitalizing getaway amidst the beauty of the forest.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8ee7986e-2320-498d-9afd-900701f8aa14", "translation" => "Que vous soyez un amoureux de la nature, un randonneur avide d'aventure ou simplement en quête d'un havre de paix, la cascade de Kheneg Mayoum est l'endroit parfait pour une escapade revitalisante au cœur de la beauté forestière.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "df30881d-fdd4-4a6e-bc1e-b11aa91a04dd", "translation" => "سواء كنت عاشقًا للطبيعة، أو متنزهًا بحثًا عن المغامرة، أو ببساطة تبحث عن ملاذ للسلام، شلالات خناق مايون هو المكان المثالي للهروب المنعش في قلب جمال الغابة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1048
            ["id" => "cb1e0673-a087-464c-ba78-84a1ee6f839d", "translation" => "The town hall of Sour el Ghouzlane, dating back to the colonial era, is an emblematic building that bears witness to the French architectural influence of that time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "19fb55a4-80f1-42ae-8c85-4b0dbba7d6ec", "translation" => "L'hôtel de ville de Sour el Ghouzlane, datant de l'époque coloniale, est un édifice emblématique qui témoigne de l'influence architecturale française de cette période.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "88592264-77cc-4803-8c94-e3c4b6fe8b18", "translation" => "بلدية سور الغزلان، التي تعود إلى العصر الاستعماري، هي مبنى بارز يشهد على التأثير المعماري الفرنسي في تلك الفترة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1049
            ["id" => "22f48361-a0f3-4056-9c7f-a7e9517ff55a", "translation" => "The picturesque landscapes and the tranquility that prevails here make it an ideal place to escape the hustle and bustle of everyday life and fully connect with nature. Prepare for a unique experience and total immersion in a preserved but challenging-to-reach natural location.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "602e9772-d850-4c2e-95e0-83e31ee7f812", "translation" => "Les paysages pittoresques et la tranquillité qui règne ici en font un lieu idéal pour échapper à l'agitation de la vie quotidienne et se connecter pleinement à la nature. Préparez-vous à une expérience unique et à une immersion totale dans un lieu naturel préservé mais difficilement accessible.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f689068c-cf9a-4f44-8f2f-763bef3e199c", "translation" => "المناظر الخلابة والهدوء السائد هنا يجعلانه مكانًا مثاليًا للهروب من صخب الحياة اليومية والتواصل الكامل مع الطبيعة. قم بالتحضير لتجربة فريدة وانغماس كامل في موقع طبيعي محفوظ ولكنه صعب الوصول.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1050
            ["id" => "8247cc26-8ec6-4af5-898f-7495c56643eb", "translation" => "Whether it's for a peaceful stroll, a picnic outing, or simply to rejuvenate, the Zerdaza dam is the perfect place to escape the fast pace of daily life and enjoy cherished moments with your friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5d01e48d-a68c-40b2-b9ba-f6debe0bbcbb", "translation" => "Que ce soit pour une promenade paisible, une séance de pique-nique ou simplement pour se ressourcer, le barrage de Zerdaza est l'endroit idéal pour échapper au rythme effréné de la vie quotidienne et profiter de moments privilégiés avec vos proches.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "23a3dfcd-d6f6-45e0-bfb9-a0847cda64d1", "translation" => "سواء كان ذلك للمشي الهادئ، أو لجلسة نزهة، أو ببساطة للتجديد، فإن سد زردازة هو المكان المثالي للهروب من وتيرة الحياة اليومية السريعة والاستمتاع بلحظات عزيزة مع أحبائك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1051
            ["id" => "805a86dd-d7ac-4881-aa3a-b0e04c38132e", "translation" => "Discover the beautiful Boussiaba dam, a must-visit destination for nature lovers and adventure enthusiasts. An ideal place to rejuvenate and connect with the serene beauty of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6d4cd04e-840c-449d-89dd-231f061ae4b0", "translation" => "Découvrez le magnifique barrage de Boussiaba, une destination incontournable pour les amoureux de la nature et les passionnés d'aventure. Un endroit idéal pour se ressourcer et se connecter avec la beauté sereine de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d004e764-db1b-4ba9-ae83-f64bf82ecca7", "translation" => "اكتشف سد بوسيابة الجميل، وجهة لا غنى عنها لعشاق الطبيعة وعشاق المغامرة. مكان مثالي للاسترخاء والتواصل مع جمال الطبيعة الهادئة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1052
            ["id" => "458b27ad-727f-4426-aa27-25a2e2c37775", "translation" => "With its fine sandy shores stretching as far as the eye can see, this beach provides an idyllic setting for sunbathing and enjoying the clear waters of the sea. The gentle waves invite refreshing swims and water sports activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "637428fc-95f1-44a2-8032-8d6828da9f84", "translation" => "Avec son sable fin s'étendant à perte de vue, cette plage offre un cadre idyllique pour se prélasser au soleil et profiter des eaux claires de la mer. Les vagues douces invitent à la baignade rafraîchissante et à la pratique d'activités nautiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d90d5822-6e19-4f79-9127-3ab82e2022d1", "translation" => "بفضل رمالها الناعمة البديعة التي تمتد إلى مالا نهاية، يقدم هذا الشاطئ إطارًا مثاليًا للاستلقاء تحت أشعة الشمس والاستمتاع بمياه البحر الصافية. الأمواج اللطيفة تجذب للسباحة المنعشة وممارسة أنشطة مائية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1053
            ["id" => "3371853f-5f42-47e3-b37c-2ac1b369390a", "translation" => "Discover the Beni Belaid nature reserve, a true natural treasure to explore! This beautiful ten-hectare lake is surrounded by lush aquatic vegetation and is home to a diverse wildlife.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ffc5f0ad-f0ae-48d0-95a2-af66fc5f83da", "translation" => "Découvrez la réserve naturelle de Beni Belaid, un véritable trésor naturel à explorer ! Ce magnifique lac de dix hectares est entouré d'une végétation lacustre luxuriante et abrite une faune diversifiée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6f467b9a-e2ce-405e-8720-00b33f06254f", "translation" => "اكتشف محمية بني بلعيد الطبيعية، كنز طبيعي حقيقي يمكن استكشافه! هذه البحيرة الجميلة التي تبلغ مساحتها عشرة هكتارات محاطة بنباتات مائية غنية وتضم مجموعة متنوعة من الحياة البرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1054
            ["id" => "5d3871d0-b506-42c0-b1c8-04eb3f8aa99b", "translation" => "Despite the challenging access, a visit to El Attaf beach is well worth it. You'll be rewarded with a spectacular coastal landscape, crystal-clear waters, and absolute tranquility. Prepare to immerse yourself in the pristine beauty of this secluded beach and have an unforgettable experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3166033e-76ce-4d57-8eaa-ce6ea758fde3", "translation" => "Malgré les difficultés d'accès, une visite à la plage d'el Attaf en vaut la peine. Vous serez récompensé par un paysage côtier spectaculaire, des eaux cristallines et une tranquillité absolue. Préparez-vous à vous immerger dans la beauté préservée de cette plage isolée et à vivre une expérience inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "123773dd-3ccd-4747-ab20-35c8ae418440", "translation" => "على الرغم من صعوبة الوصول، إن زيارة شاطئ العطاف تستحق بالفعل. ستكون مكافأتك إطلالة ساحرة على الساحل، ومياه واضحة, وهدوء تام. قدّر نفسك لتجربة لا تُنسى حينما تتوغل في جمال هذا الشاطئ المعزول وتعيش تجربة فريدة من نوعها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1055
            ["id" => "8a66991e-00c4-4773-9ca9-9347310137e1", "translation" => "The mussels rock beach gets its name from an imposing rock located about a hundred meters from the shore. With its pristine natural setting and lifeguard service, this beach is the perfect place to relax, swim, and enjoy the beauty of the coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2cb8f249-a002-4838-8318-18b939fbc322", "translation" => "La plage du Rocher aux Moules tire son nom d'un imposant rocher situé à une centaine de mètres du rivage. Avec son cadre naturel préservé et sa surveillance assurée, cette plage est l'endroit idéal pour se détendre, se baigner et profiter de la beauté du littoral.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "33cebfeb-bf8c-4b53-a55d-5df0aaa094e1", "translation" => "شاطئ صخر البلح يأخذ اسمه من صخرة مهيبة تقع على بعد حوالي مئة متر من الشاطئ. مع بيئتها الطبيعية المحفوظة والمراقبة المضمونة, يعتبر هذا الشاطئ المكان المثالي للاسترخاء والسباحة والاستمتاع بجمال الساحل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1056
            ["id" => "1a1f0f1a-a269-465e-9fbd-0412eb73a48e", "translation" => "With its preserved natural setting and impressive dimensions, the Sidi Abdelaziz beach is a perfect place to relax, stroll along the shoreline, and recharge in the great outdoors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0519a1b3-a0ad-4137-aedf-2bdcb1fc4545", "translation" => "Avec son cadre naturel préservé et ses dimensions impressionnantes, la plage de Sidi Abdelaziz est un lieu parfait pour se détendre, se promener le long du rivage et se ressourcer en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7e9b32a5-7991-4f80-943a-766b11f9c5f6", "translation" => "مع إعدادها الطبيعي المحافظ وأبعادها الرائعة، شاطئ سيدي عبد العزيز هو مكان مثالي للاسترخاء، والتجول على طول الشاطئ، وإعادة الشحن في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1057
            ["id" => "e029d764-2e46-463d-b776-25c124c0d148", "translation" => "El Mzair beach is a charming and captivating coastal destination. With its fine, golden sand, it provides an ideal setting for relaxation and enjoying the coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "02f21971-baca-4bb4-bdeb-9c6e8eb5eab6", "translation" => "La plage el Mzair est une destination côtière charmante et captivante. Avec son sable fin et doré, elle offre un cadre idéal pour se détendre et profiter du littoral.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cffe9d44-1277-4972-b125-f3f0baf4d558", "translation" => "شاطئ المزاير هو وجهة ساحرة وجذابة على الساحل. بفضل رماله الناعمة والذهبية، يوفر إطارًا مثاليًا للاسترخاء والاستمتاع بالساحل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1058
            ["id" => "33c53957-5ba5-4795-9c6e-be869011963c", "translation" => "Whether you want to sunbathe, swim, or simply take a stroll along the beach, El Kennar is an ideal place to escape the hectic pace of daily life and enjoy the natural beauty of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "11eea1ec-9222-47f5-b9b3-58147b811c1d", "translation" => "Que vous souhaitiez vous prélasser au soleil, vous baigner ou simplement vous promener le long de la plage, el Kennar est un endroit idéal pour échapper au rythme effréné de la vie quotidienne et profiter de la beauté naturelle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c213ff97-da76-4e35-b6ed-ba281b1ac8ea", "translation" => "سواء كنت ترغب في التمتع بأشعة الشمس، أو السباحة، أو مجرد التجول على طول الشاطئ، القنار هو مكان مثالي للابتعاد عن إيقاع الحياة اليومية المشغولة والاستمتاع بجمال الطبيعة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1059
            ["id" => "b51bae58-05a3-403c-9b79-adeef2063bbc", "translation" => "Whether you want to relax in the sun, swim, or take a stroll along the coast, this beach invites you to enjoy pleasant moments in harmony with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2b461852-c59d-4af4-8d1d-53c7d4da31d9", "translation" => "Que vous souhaitiez vous détendre au soleil, vous baigner ou vous promener le long de la côte, cette plage vous invite à passer des moments agréables en harmonie avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "631e3c29-b853-45ce-9259-75a41b3f5a0c", "translation" => "سواء كنت ترغب في الاسترخاء تحت أشعة الشمس، أو السباحة، أو التجول على طول الساحل، يدعوك هذا الشاطئ للاستمتاع بلحظات ممتعة في وئام مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1060
            ["id" => "5fbf6979-a67e-4807-a07e-290ce26d833a", "translation" => "Although the beach is not supervised, it remains an attractive spot for nature lovers and those seeking tranquility. You can enjoy the clear waters and relax on the sand while immersing yourself in the serene atmosphere of the Azroud beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b96680fb-be85-4557-b93e-7a613212d620", "translation" => "Bien que la plage ne soit pas surveillée, elle reste un endroit attrayant pour les amoureux de la nature et les amateurs de tranquillité. Vous pourrez profiter des eaux claires et vous détendre sur le sable, tout en vous imprégnant de l'atmosphère sereine qui règne sur la plage d'Azroud.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ea7d8900-71a7-47f2-be70-76444c1be140", "translation" => "على الرغم من أن الشاطئ لا يتم مراقبته، إلا أنه لا يزال مكانًا جذابًا لعشاق الطبيعة ومحبي الهدوء. يمكنك الاستمتاع بمياهه الصافية والاسترخاء على الرمال، بينما تنغمس في الجو الهادئ الذي يسود شاطئ آزرود.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1061
            ["id" => "9dceaaa4-b734-45b6-87a7-9ca925b8fd2b", "translation" => "Whether it's for a peaceful stroll, a gathering with friends, or simply for resting on a bench, you will find in this garden a welcoming and pleasant space.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dd959486-fcc1-4fee-96cc-9db32790e858", "translation" => "Que ce soit pour une promenade paisible, une rencontre avec des amis ou simplement pour se reposer sur un banc, vous trouverez dans ce jardin, un espace accueillant et agréable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3380d7df-18d9-4fa4-bc4c-07f14b6d1f5a", "translation" => "سواء كان ذلك لجولة هادئة، أو للقاء مع الأصدقاء، أو ببساطة للراحة على مقاعد الجلوس، ستجد في هذه الحديقة مكانًا مرحبًا ولطيفًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1062
            ["id" => "8cfb35fb-c7fd-4042-a39f-3139a71bd57c", "translation" => "Whether for a refreshing swim, a stroll along the shore, or simply to admire the picturesque landscapes, the Tassoust beach is a must-visit destination for nature lovers and seekers of tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "30a0263c-ea60-4243-b377-47267fd3ab55", "translation" => "Que ce soit pour une baignade rafraîchissante, une promenade le long du rivage ou simplement pour admirer les paysages pittoresques, la plage de Tassoust est un lieu incontournable pour les amoureux de la nature et les chercheurs de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "06991eaf-ed16-4247-8181-bbcdf047c134", "translation" => "سواء كنت تبحث عن سباحة منعشة أو نزهة على طول الشاطئ أو ببساطة للاستمتاع بالمناظر الخلابة، شاطئ تاسوست هو وجهة لا غنى عنها لعشاق الطبيعة والباحثين عن الهدوء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1063
            ["id" => "046ae0c0-12b4-4aad-877a-444a2939c121", "translation" => "Whether you are seeking relaxation, adventure, or natural discoveries, the El Agram dam is the perfect place to escape the everyday and connect with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3e40c0fc-1452-4ddd-8867-0b1b95e71813", "translation" => "Que vous soyez en quête de détente, d'aventure ou de découvertes naturalistes, le barrage d'el Agram est l'endroit idéal pour échapper au quotidien et se connecter avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3c150785-0079-4da6-8e42-26c5430793ed", "translation" => "سواء كنتم تبحثون عن الاسترخاء، المغامرة، أو اكتشافات طبيعية، فإن سد العقرم هو المكان المثالي للابتعاد عن الحياة اليومية والتواصل مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1064
            ["id" => "a588b675-b325-4874-889a-f2adfe9e5519", "translation" => "With its fine sand stretching over a considerable distance, this beach provides plenty of space for lounging, strolling, and enjoying seaside activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "61c89423-b645-4de1-9aa5-444590cfaafb", "translation" => "Avec son sable fin s'étendant sur une distance considérable, cette plage offre amplement d'espace pour se prélasser, se promener et profiter des activités en bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "aec00dd5-32c6-44e5-aa75-ed18af596060", "translation" => "بفضل رمالها الناعمة التي تمتد على مسافة كبيرة، يقدم هذا الشاطئ مساحة كبيرة بوفرة للراحة، والتجول، والاستمتاع بالأنشطة على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1065
            ["id" => "b939b6f3-4127-4bd9-8eb1-8b9fa50a252c", "translation" => "Whether you're a seafood enthusiast, a photography enthusiast, or simply curious to explore marine life, a visit to the Jijel fishing port will allow you to have a memorable experience and connect with the essence of this charming coastal town.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "93bf99ac-7504-4945-8b01-f070f1b62ae9", "translation" => "Que vous soyez un amateur de fruits de mer, un passionné de photographie ou simplement curieux de découvrir la vie maritime, une visite au port de pêche de Jijel vous permettra de vivre une expérience mémorable et de vous connecter à l'essence même de cette charmante ville côtière.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6f429f63-37ff-4cb5-bf17-0c79d65501ad", "translation" => "سواء كنت عاشقًا للمأكولات البحرية، أو مهووسًا بالتصوير، أو مجرد فضولي لاستكشاف حياة البحر، ستتيح لك زيارة ميناء صيد جيجل تجربة لا تُنسى وتواصل مع جوهر هذه المدينة الساحلية الجميلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1066
            ["id" => "f67e4f2f-d8ed-44c5-8791-279cd8fb5f9e", "translation" => "Whether you're looking for a breathtaking landscape to admire the sunset or a unique place to stroll and connect with nature, the Beaumarchais rocky beach is a must-visit destination.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "33715227-d9a4-408f-91e5-cc7c2f83b0f4", "translation" => "Que vous soyez à la recherche d'un paysage époustouflant pour admirer le coucher de soleil ou d'un endroit unique pour vous promener et vous connecter à la nature, la plage rocheuse de Beaumarchais est un lieu à ne pas manquer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b4aadb84-787e-456a-83dd-e7356c92c0ef", "translation" => "سواء كنتم تبحثون عن مناظر خلابة لمشاهدة غروب الشمس أو عن مكان فريد للتجول والتواصل مع الطبيعة، فإن شاطئ بومارشي الصخري هو مكان لا يجب تفويته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1067
            ["id" => "dc07d360-d94d-460f-90f9-4a508fedbb43", "translation" => "Whether you want to relax on the sand, swim in clear waters, or simply admire the natural beauty of the surroundings, the Boussadoune beach offers a pleasant seaside experience in a delightful setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "421739ed-54a1-416d-8dca-7aaa32a63c2e", "translation" => "Que vous souhaitiez vous détendre sur le sable, vous baigner dans des eaux claires ou simplement admirer la beauté naturelle des environs, la plage de Boussadoune offre une expérience balnéaire agréable dans un cadre agréable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "77a3e999-5c53-414b-9593-3aac3ada24fb", "translation" => "سواء كنتم ترغبون في الاسترخاء على الرمال، السباحة في مياه نقية، أو ببساطة التمتع بجمال الطبيعة المحيطة، شاطئ بوسعدون يقدم تجربة شاطئية ممتعة في إطار ساحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1068
            ["id" => "a6ee05af-6a8c-4837-8b59-d355751c0754", "translation" => "Whether you're looking to relax on the sand, swim in clear waters, or simply admire the natural beauty of the surroundings, the Zaway beach offers a pleasant seaside experience in a peaceful setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a0bd3813-c1c0-477b-a559-cf5e53d65d83", "translation" => "Que vous cherchiez à vous détendre sur le sable, à vous baigner dans des eaux claires ou à admirer la beauté naturelle des environs, la plage de Zaway offre une expérience balnéaire plaisante dans un cadre paisible.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "749283c1-cac4-4476-b916-914d801eafed", "translation" => "سواء كنت تبحث عن الاسترخاء على الرمال، أو السباحة في مياه نقية، أو ببساطة التمتع بجمال الطبيعة المحيطة، شاطئ الزواي يقدم تجربة شاطئية ممتعة في إطار هادئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1069
            ["id" => "0f097370-898c-43e8-90d3-475d80c6d6ea", "translation" => "The Ouled Bounar beach is an ideal destination to enjoy the coastline and relax in an enchanting setting. It attracts visitors with its natural beauty and tranquil atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aa3ede1c-64f5-4a45-b906-945cff0d5d1a", "translation" => "La plage d’Ouled Bounar est une destination idéale pour profiter du littoral et se détendre dans un cadre enchanteur.Elle attire ainsi les visiteurs par sa beauté naturelle et son ambiance tranquille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "37f1c40f-5ebb-4bc7-b556-1004ef5474f7", "translation" => "شاطئ أولاد بونار هو وجهة مثالية للاستمتاع بالساحل والاسترخاء في إطار ساحر. إنه يجذب الزوار بجماله الطبيعي وجوه الهادئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1070
            ["id" => "b7ce8726-aa94-4653-bda2-d6b45bfdde39", "translation" => "Whether you're looking to relax on the sand, explore the underwater world, or simply enjoy the tranquility of nature, the 1st cove is the perfect place for a memorable seaside getaway.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "acda7c46-021a-47c8-8ef4-040602412628", "translation" => "Que vous cherchiez à vous détendre sur le sable, à explorer les fonds marins ou à simplement profiter de la tranquillité de la nature, la 1ère crique est l'endroit idéal pour une escapade balnéaire mémorable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "096debb4-b9fd-4711-956d-dea1db9e5cdc", "translation" => "سواء كنت تبحث عن الاسترخاء على الرمال، استكشاف عالم البحار، أو ببساطة الاستمتاع بهدوء الطبيعة، الخليج 1 هو المكان المثالي لقضاء عطلة شاطئية لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1071
            ["id" => "80e80282-a187-4cba-881b-8c5d983c752a", "translation" => "The 2nd cove offers a small but welcoming space, ideal for those seeking a quiet spot to relax and enjoy the coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d69d3399-d514-47a7-99a8-926bf9d4aec2", "translation" => "La 2ème crique offre un espace restreint mais accueillant, idéal pour ceux qui recherchent un coin tranquille pour se détendre et profiter du littoral.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2a39507e-2c7f-4cd8-865a-c20859607cc7", "translation" => "الخليج 2 يقدم مساحة ضيقة ولكن مرحبة، مثالية لأولئك الذين يبحثون عن مكان هادئ للاسترخاء والاستمتاع بالساحل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1072
            ["id" => "912f421b-0e39-4e69-ae70-73082a5fcc8c", "translation" => "The big lighthouse beach is renowned for its fine golden sand that stretches over an impressive length. It provides plenty of space for relaxation, strolling, and enjoying the pleasures of the seaside.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6e394fe3-316c-4714-8166-6d2838daf63d", "translation" => "La plage du Grand phare est réputée pour son sable fin et doré qui s'étend sur une longueur impressionnante. Elle offre amplement d'espace pour se détendre, se promener et profiter des plaisirs du bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ea6ad957-3b74-467d-8bcd-0a0b005a203a", "translation" => "شاطئ المنار الكبير مشهور برماله الناعمة والذهبية التي تمتد على طول مسافة معاييره. يوفر مساحة كبيرة بوفرة للراحة والتجول والاستمتاع بمتع الساحل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1073
            ["id" => "e3793639-b059-4f84-9c9e-230391a492f5", "translation" => "The Ghaba Park recreational forest is a popular destination for families, groups of friends, and nature enthusiasts in Jijel. It's the perfect place to spend a pleasant day outdoors, surrounded by greenery, entertainment, and relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "151b11d0-f4cc-46c1-bb11-d9ff85bccb30", "translation" => "La forêt récréative Ghaba Park est un lieu prisé pour les familles, les groupes d'amis et les amoureux de la nature à Jijel. C'est l'endroit idéal pour passer une journée agréable en plein air, entouré de verdure, de divertissement et de détente.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "eee6de40-87f9-4ea6-8c6c-5b7f6af50c33", "translation" => "غابة بارك هي وجهة مشهورة للعائلات ومجموعات الأصدقاء وعشاق الطبيعة في جيجل. إنها المكان المثالي لقضاء يوم ممتع في الهواء الطلق، محاطين بالمساحات الخضراء و المرح والاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1074
            ["id" => "181c6037-d3ba-42b2-8ea1-b36cb13f0107", "translation" => "The Kissir dam is an engineering marvel and a must-visit destination for nature enthusiasts and lovers of magnificent landscapes. This place offers a unique experience where water and greenery harmoniously come together.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "622a3565-8132-4303-b155-e9dc465ea0db", "translation" => "Le barrage de Kissir est une merveille d'ingénierie et une destination incontournable pour les amateurs de nature et de paysages magnifiques. Ce lieu offre une expérience unique où l'eau et la verdure se rencontrent harmonieusement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6b438a59-b78a-44b3-b7f4-923d4c08ba40", "translation" => "سد كسير هو عجب هندسي ووجهة لا بد من زيارتها لعشاق الطبيعة وعشاق المناظر الخلابة. هذا المكان يقدم تجربة فريدة حيث تلتقي المياه والخضرة بانسجام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1075
            ["id" => "4541c7fe-c942-4ef5-88f8-63734812c743", "translation" => "Whether you're looking for family entertainment or just a day of relaxation, the Oumnia amusement park is the perfect place to spend an unforgettable time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cb3a8520-c431-478b-a81e-fd830d35011b", "translation" => "Que vous soyez à la recherche de divertissement en famille ou simplement d'une journée de détente, le parc d'attractions Oumnia est l'endroit idéal pour passer un moment inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3ebb8f59-d2fa-478d-9eed-1a7e78dee27e", "translation" => "سواء كنتم تبحثون عن ترفيه للعائلة أو مجرد يوم للاسترخاء، تعد حديقة التسلية أمنية المكان المثالي لقضاء وقت لا يُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1076
            ["id" => "959117e2-ad59-4f34-8c23-78119836885a", "translation" => "The garden is a true haven of peace in the heart of the city. It provides a lush green space where visitors can relax and enjoy the beauty of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "466fee83-e771-4c52-96d3-e91e456e00f9", "translation" => "Le jardin est un véritable havre de paix au cœur de la ville. Il offre un espace vert luxuriant où les visiteurs peuvent se détendre et profiter de la beauté de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "53989336-5e71-4e15-9b9c-a97d9484aa5b", "translation" => "الحديقة هي حقًا ملاذ للسلام في قلب المدينة. إنها توفر مساحة خضراء غنية حيث يمكن للزوار الاسترخاء والاستمتاع بجمال الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1077
            ["id" => "96a99ac5-38ea-4b83-962c-5f90c5836b26", "translation" => "Whether you're a craft enthusiast, curious about local culture, or simply seeking an enriching experience, the traditional crafts house is a must-visit destination.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "46089d2f-4c16-4188-b57b-634db140e950", "translation" => "Que vous soyez un amateur d'artisanat, un curieux de la culture locale ou tout simplement en quête d'une expérience enrichissante, la maison de l'artisanat traditionnel est un incontournable à visiter.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d209ee46-0509-4878-ab4a-73c0c7c38f1a", "translation" => "سواء كنت عاشقًا للحرف اليدوية، متطلعًا لاستكشاف الثقافة المحلية، أو مجرد بحثك عن تجربة غنية، فإن دار الحرف التقليدية هو وجهة لا بد من زيارتها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1078
            ["id" => "ad6481b5-98c6-423b-a9ca-bee540b8e4e0", "translation" => "The Jijel house of culture is a dynamic and vibrant place dedicated to promoting arts, culture, and creativity in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2e48235b-6c05-4bf5-a7f1-c36c7517743f", "translation" => "La maison de la culture de Jijel est un lieu dynamique et vibrant dédié à la promotion des arts, de la culture et de la créativité dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4e251e2d-79d1-43ee-959d-fab5f12f8857", "translation" => "دار الثقافة في جيجل مكان دينامي وحيوي مخصص لتعزيز الفنون والثقافة والإبداع في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1079
            ["id" => "9dc8f2f1-e17c-4aa9-a11c-92890d9810bf", "translation" => "Whether you're in search of relaxation on the warm sand, aquatic adventures, or simply a beautiful natural setting, the Kissir beach is the perfect place to spend a day of relaxation and outdoor enjoyment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "10e8ed9b-682a-48ca-92ef-178b9ebd911a", "translation" => "Que vous soyez à la recherche de moments de détente sur le sable chaud, d'aventures aquatiques ou tout simplement d'un cadre naturel magnifique, la plage Kissir est l'endroit idéal pour passer une journée de détente et de plaisir en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2cba17ce-2b1e-4d26-b7cf-7bbd1d67ebcc", "translation" => "سواء كنتم تبحثون عن لحظات من الاسترخاء على الرمال الدافئة، أو مغامرات في الماء، أو ببساطة إعداد طبيعي رائع، فإن شاطئ كيسير هو المكان المثالي لقضاء يوم من الاسترخاء والتمتع بالهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1080
            ["id" => "06658aea-343f-488f-9e75-4692fd0e8b9f", "translation" => "This beach stretches over an impressive length, providing visitors with ample space to relax, stroll, and soak up the sun. The beach is also ideal for various water activities such as diving, windsurfing, and more.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "83caa4af-6b86-49fa-a95d-696e5f8193b8", "translation" => "Cette plage s'étend sur une longueur impressionnante, offrant aux visiteurs un espace généreux pour se détendre, se promener et profiter du soleil. La plage est également propice à la pratique de diverses activités nautiques telles que la plongée, la planche à voile etc…", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "49837054-665a-4d1e-99fe-ebba99cbda9c", "translation" => "يمتد هذا الشاطئ على طول مثير، مما يوفر للزوار مساحة وفيرة للاسترخاء والتجول والاستمتاع بأشعة الشمس. الشاطئ أيضًا مناسب لممارسة مجموعة متنوعة من الأنشطة المائية مثل الغوص وركوب الأمواج وغيرها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1081
            ["id" => "f8e47315-3fda-4860-944b-bcbd9b61c313", "translation" => "The surrounding landscape adds to the allure of the beach. The rock formations provide a spectacular backdrop, creating an atmosphere of serenity and escape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "93dbf56d-e64e-4a8f-864b-56625b8a46e2", "translation" => "Le paysage environnant ajoute à l'attrait de la plage. Les formations rocheuses offrent un arrière-plan spectaculaire, créant une atmosphère de tranquillité et d'évasion.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f872a643-3c99-46cb-962a-cd1ad2d8206f", "translation" => "المشهد المحيط يضيف إلى جاذبية الشاطئ. توفر تكوينات الصخور خلفية رائعة، مما يخلق أجواءً من السكينة والهروب.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1082
            ["id" => "a5deec8f-701d-4d2f-a3ce-f9ae723d7e1f", "translation" => "Stretching over a considerable distance, the Chalat beach provides swimmers and sun enthusiasts with ample space to relax and enjoy the coastal scenery.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1c7d08d7-a71a-4ae7-80e1-05d7ccfae815", "translation" => "S'étendant sur une distance considérable, la plage de Chalat offre aux baigneurs et aux amateurs de soleil un espace spacieux pour se détendre et profiter du paysage côtier.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d8588808-3292-42aa-b1f5-082d4e84fc92", "translation" => "يمتد شاطئ الشالات على مسافة كبيرة، مما يوفر للسبّاحين مساحة واسعة للاسترخاء والاستمتاع بالمناظر الساحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1083
            ["id" => "9795af10-bdff-445b-8efe-0e611f722deb", "translation" => "Whether you're looking for relaxation on the sand, aquatic adventures, or simply a place of natural beauty to recharge, El Aouana beach is the perfect spot to spend an unforgettable day by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "18655dae-664f-48f4-b43a-93b90035f5fa", "translation" => "Que vous recherchiez des moments de détente sur le sable, des aventures aquatiques ou tout simplement un lieu de beauté naturelle pour vous ressourcer, la plage d’el Aouana est l'endroit idéal pour passer une journée inoubliable en bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "76b76b5d-3c40-48b4-a067-eac2eccdeedb", "translation" => "سواء كنتم تبحثون عن لحظات الاسترخاء على الرمال، مغامرات مائية أو مجرد مكان للجمال الطبيعي للتجديد، شاطئ العوانة هو المكان المثالي لقضاء يوم لا يُنسى على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1084
            ["id" => "df04c536-19d1-445b-9248-a7157f70e077", "translation" => "Whether you're a passionate angler, a boating enthusiast, or simply seeking an authentic maritime atmosphere, El Aouana fishing and marina port is a must-visit destination where you can experience the lively coastal life and savor the charms of the Mediterranean Sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b951bdf3-01f6-4292-aecd-2309c3cca1db", "translation" => "Que vous soyez passionné de pêche, adepte de navigation de plaisance ou simplement à la recherche d'une ambiance maritime authentique, le port de pêche et de plaisance d'el Aouana est un lieu incontournable où vous pourrez découvrir la vie animée du littoral et profiter des charmes de la mer Méditerranée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "46b96bff-c21c-4ba9-9446-9172cd276dc4", "translation" => "سواء كنت عاشقًا لصيد الأسماك، مهتمًا برياضة الإبحار، أو مجرد بحثك عن أجواء بحرية أصيلة، ميناء العوانة للصيد والإبحار هو وجهة لا غنى عنها حيث يمكنك اكتشاف حياة الساحل النابضة بالحياة والاستمتاع بجاذبية البحر الأبيض المتوسط.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1085
            ["id" => "14b603ee-7b74-48e3-8be9-9b850cc4a30f", "translation" => "The island of El Aouana is a true natural gem located off the coast of Jijel. It is easily accessible from the main beach. You can easily find boats ready to take you to this paradise island and pick you up at your convenience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e45b5992-20f7-49c5-aac1-c12e757aa2c3", "translation" => "L'île d'el Aouana est un véritable joyau naturel situé au large de la côte de Jijel. Elle est facilement accessible depuis la plage principale. Vous pouvez facilement trouver des bateaux prêts à vous emmener vers cette île paradisiaque et revenir vous chercher à votre convenance.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "78e8d203-e555-42cf-8516-8bc1558584d8", "translation" => "جزيرة العوانة هي جوهرة طبيعية حقيقية تقع قبالة ساحل جيجل. يمكن الوصول إليها بسهولة من الشاطئ الرئيسي. يمكنك بسهولة العثور على قوارب جاهزة لأخذك إلى هذه الجزيرة وإعادتك حسب رغبتك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1086
            ["id" => "894bdafc-9268-4166-825a-829b6f54cc1e", "translation" => "Whether it's for swimming, admiring the breathtaking landscapes, or simply enjoying the tranquility of nature, the Port Maria beach is a true treasure to discover during your visit to Jijel.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "32346137-ebb3-439e-8e6c-20db84e181ee", "translation" => "Que ce soit pour se baigner, admirer les paysages époustouflants ou simplement profiter du calme de la nature, la plage de port Maria est un véritable trésor à découvrir lors de votre visite à Jijel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "73f07d0b-eec4-4d02-a707-1cbf0d12c19f", "translation" => "سواء كنت ترغب في السباحة، أو مشاهدة المناظر الخلابة، أو مجرد الاستمتاع بسكينة الطبيعة، فإن شاطئ ميناء ماريا هي كنز حقيقي يجب اكتشافه خلال زيارتك إلى جيجل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1087
            ["id" => "5072e0ec-aef1-4bae-bbff-9de94ee8675c", "translation" => "The Aftis beach is a true natural gem on the coast. With its golden sand and clear waters, it provides an idyllic setting for sea and sun lovers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "21d9535f-571e-41b2-97e7-39093472381d", "translation" => "La plage des Aftis est un véritable joyau naturel sur la côte. Avec son sable doré et ses eaux claires, elle offre un cadre idyllique pour les amoureux de la mer et du soleil.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1aeab721-578d-4e03-b082-3a65a9ed604d", "translation" => "شاطئ افتيس هو جوهرة طبيعية حقيقية على الساحل. برمالها الذهبية ومياهها الصافية، يوفر إعدادًا مثاليًا لعشاق البحر والشمس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1088
            ["id" => "a6d25f4a-3836-49d3-8227-8e8e01f310b6", "translation" => "Discover Taza beach, a hidden gem that promises a unique experience. Although this beach is rocky, don't worry, appropriate footwear will allow you to fully enjoy its crystal-clear waters.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c96c3eb6-6eff-4544-9393-5a8e50abeacc", "translation" => "Découvrez la plage de Taza, un véritable bijou caché qui promet une expérience unique. Bien que cette plage soit caillouteuse, ne vous inquiétez pas, des chaussures adaptées vous permettront de profiter pleinement de ses eaux cristallines.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "af0c4aeb-ab12-4135-9425-f034987bafc2", "translation" => "اكتشف شاطئ تازة، جوهرة مخفية تعد بتجربة فريدة. على الرغم من أن هذا الشاطئ مليء بالصخور، لا تقلق، الأحذية المناسبة ستمكنك من الاستمتاع بمياهه الصافية بشكل كامل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1089
            ["id" => "30a198b2-2e66-4e60-b7ac-878380426b17", "translation" => "If you're ready to have a unique experience exploring this rocky beach, don't miss the opportunity to spend a memorable day at the Wonderful caves beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2cb3fe57-d1a2-494a-b31e-401ea7bc291e", "translation" => "Si vous êtes prêt à vivre une expérience unique en explorant cette plage caillouteuse, ne manquez pas l'occasion de passer une journée mémorable à la plage des grottes merveilleuses.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "62a89066-48c8-4e34-b112-cbe1dd471833", "translation" => "إذا كنت مستعدًا للعيش تجربة فريدة من نوعها في استكشاف هذا الشاطئ الصخري، فلا تفوت الفرصة لقضاء يوم لا يُنسى على شاطئ الكهوف العجيبة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1090
            ["id" => "977a6611-a21f-42d4-8feb-c91b427aebd2", "translation" => "The Ziama Mansouriah port is a bustling and picturesque place where maritime activity is at its peak. It provides a captivating spectacle with its colorful boats gently swaying with the waves.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aea0748c-a7c8-4e24-ac63-aed166c88b0a", "translation" => "Le port de Ziama Mansouriah l est un lieu animé et pittoresque où l'activité maritime est à son apogée. Il offre un spectacle fascinant avec ses bateaux colorés qui se balancent doucement au gré des vagues.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d707a624-ff63-49e2-bbed-bf132639406e", "translation" => "ميناء زيامة المنصورية هو مكان حيوي وجميل حيث تكون النشاطات البحرية في أوجها. إنه يقدم عرضًا ساحرًا مع قواربه الملونة التي تتأرجح بلطف مع حركة الأمواج.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1091
            ["id" => "70b04b72-bbde-4efa-8bde-cfe5eeb08ae6", "translation" => "Whether you're seeking tranquility, aquatic adventure, or simply a beautiful setting to relax, El Ancer beach offers all of that and more.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "321a9ff0-c2b4-4c13-badb-977afebb1c77", "translation" => "Que vous soyez en quête de tranquillité, d'aventure aquatique ou simplement d'un cadre magnifique pour vous relaxer, la plage d'el Ancer vous offre tout cela et plus encore.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "48a651e7-3804-47d6-84de-b8ee5e6f4d8d", "translation" => "سواء كنت تبحث عن السكينة أو مغامرات مائية أو مجرد إعداد جميل للاسترخاء، شاطئ العنصر يقدم لك كل ذلك وأكثر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1092
            ["id" => "e43c8cba-d632-420d-acec-9f7d1fb6571b", "translation" => "The El Oueldja beach is a true natural gem that invites relaxation and tranquility. This sandy beach stretches over a considerable length, providing visitors with ample space to bask in the sun or stroll along the shore.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b96755d1-2639-4bfd-9008-b41924b524a0", "translation" => "La plage d'el Oueldja est un véritable joyau naturel qui invite à la détente et à la tranquillité. Cette plage de sable fin s'étend sur une longueur conséquente, offrant aux visiteurs un espace spacieux pour se prélasser au soleil ou se promener le long du rivage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e9f3d49f-cfc1-459a-85b8-b8aa312beb1c", "translation" => "شاطئ الولجة هو جوهرة طبيعية حقيقية تدعو إلى الاسترخاء والهدوء. يمتد هذا الشاطئ الرملي على مسافة كبيرة، مما يوفر للزوار مساحة واسعة للاستمتاع بأشعة الشمس أو التجول على طول الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1093
            ["id" => "87fcd1b7-a5b2-4aba-a6c7-5890a7839769", "translation" => "Under the gentle sound of the waves and the radiant sun, the Tabahrate beach is a true natural treasure waiting to be explored. Come and enjoy this place and let yourself be captivated by its tranquil beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "23460b32-45d4-4185-a93b-fae4371dc0b5", "translation" => "Sous le doux bruit des vagues et le soleil éclatant, la plage de Tabahrate est un véritable trésor naturel qui ne demande qu'à être exploré. Venez profiter de ce lieu et laissez-vous séduire par sa beauté tranquille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a5f2fd24-5d6b-48d1-ac71-13413ead61e3", "translation" => "تحت صوت ملطف للأمواج وتألق الشمس، شاطئ تبحرات كنز طبيعي حقيقي ينتظر الاستكشاف. تعال واستمتع بهذا المكان واسمح لنفسك بأن تنجرف في جماله الهادئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1094
            ["id" => "7432386b-1c4c-4fd0-8ee6-b46c692bea03", "translation" => "Whether attending a captivating theatrical performance, participating in an artistic workshop, or simply savoring the unique cultural atmosphere, the regional theatre of Adrar is a must-visit destination, blending tradition and modernity to create an immersive artistic experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8b276af2-6bc9-4733-a3a6-a1a9e11ff77b", "translation" => "Que ce soit pour assister à une représentation théâtrale captivante, participer à un atelier artistique, ou simplement savourer l'atmosphère culturelle unique, le théâtre régional d'Adrar est un lieu incontournable, fusionnant traditions et modernité pour créer une expérience artistique immersive.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c6901121-5e3a-4793-9444-8b751d83c275", "translation" => "سواء كنت تحضر أداءً مسرحيًا جذابًا، تشارك في ورشة عمل فنية، أو تستمتع بالأجواء الثقافية الفريدة، يعد المسرح الجهوي في أدرار وجهة لا يمكن تفويتها، حيث يمزج بين التقاليد والحداثة لخلق تجربة فنية غامرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1095
            ["id" => "f048b451-8ae0-4a8d-b584-49badbcc0850", "translation" => "The Monkey valley is a must-visit during your trip to the region. You will be captivated by the beauty of the landscapes and the richness of the wildlife and flora that inhabit it. You might even have the chance to spot monkeys roaming freely in their natural habitat.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "995bbe1b-3481-471a-ad7a-9d8386e6e673", "translation" => "La vallée des singes est un incontournable lors de votre visite dans la région. Vous serez captivé par la beauté des paysages et la richesse de la faune et de la flore qui l'habitent. Vous aurez peut-être même la chance d'apercevoir des singes évoluant en liberté dans leur habitat naturel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "590a4de3-eb07-4413-af8e-9d8ab10ae09c", "translation" => "وادي القرود هو وجهة لا غنى عنها أثناء زيارتك للمنطقة. ستنبهر بجمال المناظر وثراء الحياة البرية والنباتات التي تعيش فيه. قد تكون لديك حتى الفرصة لرؤية القرود تتجول بحرية في محيطها الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1096
            ["id" => "ad1db3d4-825b-4cbf-a384-b0af17cdd99a", "translation" => "The Oued dar el oued gorges, formerly known as Oued Guellil, offer a stunning natural spectacle. This river flows through a mountainous area before finally reaching the sea, creating a spectacular landscape of narrow gorges surrounded by lush vegetation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d95fe83f-c4bc-4372-8452-74fb3c136e66", "translation" => "Les gorges de Oued dar el oued, anciennement connues sous le nom d'Oued Guellil, offrent un spectacle naturel époustouflant. Ce cours d'eau traverse une zone montagneuse pour se jeter finalement dans la mer, créant ainsi un paysage spectaculaire de gorges étroites entourées d'une végétation luxuriante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e9249dfc-a6df-4589-8c63-ed4d80ffe6e7", "translation" => "مضائق واد دار الواد، المعروفة سابقًا بوادي قليل، تقدم منظرًا طبيعيًا مذهلاً. يتدفق هذا النهر عبر منطقة جبلية قبل أن يصب في النهاية في البحر، مما يخلق مناظر طبيعية رائعة من الأخاديد الضيقة المحاطة بنباتات خضراء غنية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1097
            ["id" => "b9f1909b-9b53-4cee-a68b-cbb9418668c2", "translation" => "Whether you're seeking a peaceful getaway amidst enchanting landscapes or an outdoor adventure,the Erraguene dam is the perfect place for a nature getaway.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a8a40cfc-19e9-4dbb-9a6c-a8761fae0374", "translation" => "Que vous soyez à la recherche d'une escapade tranquille au milieu de paysages enchanteurs ou d'une aventure en plein air, le barrage d'Erraguene est l'endroit idéal pour une escapade en pleine nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4c223b73-59e4-4695-97a0-3afb204384f8", "translation" => "سواء كنت تبحث عن هروب هادئ في وسط مناظر خلابة أو عن مغامرة في الهواء الطلق، سد اراقن هو المكان المثالي لقضاء عطلة في الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1098
            ["id" => "d0f3d0a7-edb4-431e-8216-e4e1e84732f9", "translation" => "Whether you're in search of peace and tranquility or a total immersion in nature, the Settara lake is the perfect place to escape the hustle and bustle of everyday life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "250fa0a8-10ff-4567-bf97-21b2679c5ae7", "translation" => "Que vous soyez en quête de calme et de tranquillité ou d'une immersion totale dans la nature, le lac de Settara est l'endroit idéal pour échapper au tumulte de la vie quotidienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6d04a8ae-cdd7-4bd0-9760-f2edd30402f3", "translation" => "سواء كنت تبحث عن الهدوء والسكينة أو عن تجربة طبيعية كاملة، فإن بحيرة السطارة هي المكان المثالي للابتعاد عن صخب الحياة اليومية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1099
            ["id" => "e8fa4a2a-9859-4f96-993f-8188f9587756", "translation" => "Whether you're a nature enthusiast, a hiking aficionado, or simply in search of peace and serenity, the Bouafroun forest is a must-visit destination in the region. Come and explore its trails, get lost in its natural beauty, and connect with the environment around you.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "81556632-f0b3-424b-83fc-7307f23813ab", "translation" => "Que vous soyez passionné de nature, adepte de randonnée ou tout simplement en quête de calme et de sérénité, la forêt de Bouafroun est un incontournable de la région. Venez explorer ses sentiers, vous perdre dans sa beauté naturelle et vous connecter avec l'environnement qui vous entoure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5aeab023-94f6-4146-b2f0-919e7d3aa310", "translation" => "سواء كنت عاشقًا للطبيعة، أو عاشقًا للمشي لمسافات طويلة، أو مجردًا تبحث عن الهدوء والسكينة، فإن غابة بوعفرون هي وجهة لا غنى عنها في المنطقة. تعال واستكشف ممراتها، وتجول في جمالها الطبيعي، وتواصل مع البيئة المحيطة بك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1100
            ["id" => "3c11849a-b51a-4ad1-b8b5-75f366b9430b", "translation" => "Family Land is an indoor amusement park designed to provide an entertaining and memorable experience for the whole family. This park offers a variety of activities and attractions carefully designed for all ages, ensuring that every family member finds something to enjoy.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e5498a31-403b-4ca0-b65b-2da691d4c2a5", "translation" => "Family Land est un parc d'attractions en intérieur conçu pour offrir une expérience divertissante et mémorable à toute la famille. Ce parc propose une variété d'activités et d'attractions soigneusement conçues pour tous les âges, assurant ainsi que chaque membre de la famille trouve quelque chose à apprécier.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "91113f6b-d83c-4510-8114-abb261a9dfa5", "translation" => "فاميلي لاند حديقة تسلية داخلي مصمم لتقديم تجربة مسلية لا تُنسى لكل العائلة. يقدم هذا المتنزه مجموعة متنوعة من الأنشطة والالعاب الترفيهية المصممة بعناية لكل الفئات العمرية، مما يضمن أن يجد كل فرد في العائلة شيئًا يستمتع به.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1101
            ["id" => "d2cb4b4b-35a1-4487-8a7c-a78416b36003", "translation" => "The Mizaba waterfalls is a captivating natural wonder that is sure to mesmerize you. They provide an enchanting spectacle of the power and beauty of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f17b8693-5619-4ab0-964a-e1d22c6c098c", "translation" => "Les chutes de Mizaba sont une merveille naturelle captivante qui ne manquera pas de vous émerveiller. Elles offrent un spectacle enchanteur de la puissance et de la beauté de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1c27d7b7-2244-4cad-a188-fda30b457f85", "translation" => "تعتبر شلالات الميزابة إحدى العجائب الطبيعية الجذابة التي من المؤكد أنها ستدهشك. إنها توفر مشهدًا ساحرًا لقوة الطبيعة وجمالها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1102
            ["id" => "ae75b799-f56b-45ab-b550-5df6d72d64a3", "translation" => "Whether it's for a peaceful stroll along the river, to enjoy a relaxing day in nature, or to explore the richness of the local biodiversity, Oued Yerjana offers a unique and soothing experience to visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b94cc020-d94a-45aa-b696-af693a2eb7e2", "translation" => "Que ce soit pour une promenade paisible le long de l'oued, pour profiter d'une journée de détente en pleine nature ou pour explorer la richesse de la biodiversité locale, l'Oued Yerjana offre une expérience unique et apaisante aux visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b52fb01a-b44a-4395-bac2-1e08811c84fc", "translation" => "سواء كنت تبحث عن نزهة هادئة على طول النهر، أو للاستمتاع بيوم من الاسترخاء في الطبيعة، أو لاستكشاف ثراء التنوع البيولوجي المحلي، يقدم واد يرجانة تجربة فريدة ومهدئة للزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1103
            ["id" => "cfb85697-ebac-4dd1-bc7c-0d2aa9e7e9b9", "translation" => "Whether you're looking for a relaxing getaway or an outdoor adventure, the Ghdir el Kehla waterfalls will provide you with an unforgettable experience. Come rejuvenate in the heart of nature, be amazed by the beauty of the waterfalls, and create lasting memories during your visit to the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d19110c8-4f40-4298-9157-b322e841c9e1", "translation" => "Que vous soyez à la recherche d'une escapade relaxante ou d'une aventure en plein air, les chutes de Ghdir el Kehla vous offriront une expérience inoubliable. Venez vous ressourcer au cœur de la nature, laissez-vous émerveiller par la beauté des cascades et créez des souvenirs mémorables lors de votre visite de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e316a088-6508-4f44-b073-aa785801749c", "translation" => "سواء كنت تبحث عن قضاء عطلة مريحة أو مغامرة في الهواء الطلق، ستقدم لك شلالات غدير الكحلة تجربة لا تُنسى. تعال لتستعيد نشاطك في قلب الطبيعة، وتعجب بجمال الشلالات، وقم بخلق ذكريات دائمة خلال زيارتك للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1104
            ["id" => "dac0921f-83ab-412e-977f-9de132a6d151", "translation" => "Whether you're a nature lover, a photography enthusiast, or simply seeking a moment of peace and tranquility, the Tabellout dam will fulfill your desires.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4c69e848-89a8-4449-8571-c51cb83cd26f", "translation" => "Que vous soyez un amoureux de la nature, un passionné de photographie ou simplement à la recherche d'un moment de calme et de tranquillité, le barrage de Tabellout saura vous combler.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "51e5b2d8-8825-4444-a5c2-a78da4514eea", "translation" => "سواء كنت عاشقًا للطبيعة، أو مهتمًا بالتصوير الفوتوغرافي، أو مجردًا تبحث عن لحظة من السكينة والهدوء، سيمنحك سد تابلوط كل ما تتمناه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1105
            ["id" => "3b16efc9-fe4c-4587-ac8c-cae68f7a71fe", "translation" => "The rocky beach of Afaghir is a natural treasure that invites you to connect with nature and marvel at its splendor. Come discover this haven of peace and let yourself be enchanted by its raw and wild beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "af8ac54f-0686-433c-8511-e5b47ca4bec6", "translation" => "La plage rocheuse d'Afaghir est un trésor naturel qui vous invite à vous connecter avec la nature et à vous émerveiller devant sa splendeur. Venez découvrir ce havre de paix et laissez-vous enchanter par sa beauté brute et sauvage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fedb425d-9e40-4ca6-ac6e-2b714d4c04a3", "translation" => "شاطئ أفاغير الصخري هو كنز طبيعي يدعوك للاتصال مع الطبيعة والتعجب من روعتها. تعال واكتشف هذا ملاذ السلام ودع نفسك تُسحر بجماله الخام والبري.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1106
            ["id" => "4be5b954-9f6c-4ff5-b0ba-5bf5f36599d6", "translation" => "Upon arriving at the old mining port of Melbou, you will be struck by the nostalgic atmosphere that pervades this place. The dilapidated buildings and structures harken back to the heyday of mining, creating a striking contrast with the surrounding coastal landscape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "580b4755-f3cb-4322-80d1-722eeef704f7", "translation" => "En arrivant à l'ancien port minier de Melbou, vous serez frappé par l'atmosphère nostalgique qui règne dans cet endroit. Les bâtiments et structures en ruine rappellent l'époque où l'exploitation minière était à son apogée, créant un contraste saisissant avec le paysage côtier environnant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "750942f0-f058-4914-9f84-86df45615b10", "translation" => "عند وصولك إلى الميناء التعديني القديم في ملبو، ستُلفت انتباهك الأجواء الحنينية التي تسيطر على هذا المكان. تُذكِّرك المباني والهياكل المتهالكة بزمن كانت فيه صناعة التعدين في أوجها، مما يخلق تباينًا بارزًا مع المناظر الساحلية المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1107
            ["id" => "94cba871-206d-4deb-9dca-327b73bcd6e7", "translation" => "Upon arriving at the Melbou beach, you will be immediately captivated by its endless fine sand. The clear waters of the sea invite for swimming and provide moments of pure relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2dcbaff1-5f00-47f6-acf9-61c86c3b6760", "translation" => "En arrivant à la plage de Melbou, vous serez immédiatement séduit par son sable fin qui s'étend à perte de vue. Les eaux claires de la mer invitent à la baignade et offrent des moments de pure détente.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0f9d9881-04f3-45b3-bee1-9f10cf6f9452", "translation" => "عند وصولك إلى شاطئ ملبو، ستُسحَر فورًا برماله الناعمة التي تمتد إلى ما لا نهاية. مياه البحر الصافية تدعو إلى السباحة وتوفر لحظات من الاسترخاء النقي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1108
            ["id" => "cd2fae2b-202e-4f4c-a98d-070584eaa06a", "translation" => "Whether you're in search of moments of tranquility and relaxation, water adventures, or simply a sunny day at the beach, the Ighzer Leblat beach is the perfect place to fulfill your desires.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dd5bdd34-a23d-4164-b8c1-110568f95ec5", "translation" => "Que vous soyez à la recherche de moments de tranquillité et de relaxation, d'aventures nautiques ou simplement d'une journée ensoleillée à la plage, la plage d'Ighzer Leblat est l'endroit idéal pour satisfaire vos envies.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "01d5e1db-409c-4f11-97c2-da0268920880", "translation" => "سواء كنتم تبحثون عن لحظات من الهدوء والاسترخاء، أو مغامرات في المياه، أو مجرد يوم مشمس على الشاطئ، فإن شاطئ إيغزر لبلاط هو المكان المثالي لتحقيق رغباتكم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1109
            ["id" => "1ebf2983-3093-4c1b-9323-e6fd3ab14940", "translation" => "Whether you're looking for relaxation, adventure, or simply enjoyable moments with family or friends, the Souk el Ténine beach is an ideal destination to fulfill your desires.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0dc04e67-bca5-4f76-bd1a-6a4094dd9822", "translation" => "Que vous soyez en quête de détente, d'aventure ou simplement de moments agréables en famille ou entre amis, la plage de Souk el Ténine est une destination idéale pour satisfaire vos envies.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "98a998d1-f826-4872-899f-03a494aeb8d0", "translation" => "سواء كنتم تبحثون عن الاسترخاء، أو المغامرة، أو ببساطة الأوقات الممتعة مع العائلة أو الأصدقاء، فإن شاطئ سوق الاثنين هو وجهة مثالية لتحقيق رغباتكم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1110
            ["id" => "9a791e9f-babd-4171-99bb-6be6dd9e7d61", "translation" => "Whether you want to take a refreshing swim or simply relax on the warm sand, the Lota beach offers you the freedom to fully enjoy the pleasures of the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0d1a6e3a-23f4-4c51-ba38-bb4da82bc947", "translation" => "Que vous souhaitiez faire quelques brasses rafraîchissantes ou simplement vous détendre sur le sable chaud, la plage de Lota vous offre la liberté de profiter pleinement des plaisirs de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6af5f8ad-fc8f-4baa-a35b-c1f41131b3ac", "translation" => "سواء كنتم ترغبون في القيام ببعض السباحة المنعشة أو ببساطة الاسترخاء على الرمال الدافئة، شاطئ لوطا يمنحكم الحرية للاستمتاع بكل متع البحر بشكل كامل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1111
            ["id" => "c50ae798-6dd9-4c2a-a651-4211b53ce5af", "translation" => "Whether you're alone, with family, or with friends, the Lota beach 2 is an ideal place to spend time relaxing, enjoying the sun, and creating unforgettable memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "149c7fd7-dfa4-49ad-b98d-6341e1af6d72", "translation" => "Que vous soyez seul, en famille ou entre amis, la plage de Lota 2 est un endroit idéal pour passer du temps à se relaxer, profiter du soleil et créer des souvenirs inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "af88eda1-6a49-4eb0-a01d-4616529c773a", "translation" => "سواء كنتم مع العائلة، أو مع الأصدقاء، شاطئ لوطا 2 هو مكان مثالي لقضاء وقت مسترخي، والتمتع بأشعة الشمس، وخلق ذكريات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1112
            ["id" => "5f14b1a1-18ae-49d9-ab84-2a8ec15df85b", "translation" => "The Aokas beach is a true coastal gem, offering spacious surroundings, clear water, and breathtaking landscapes. It's an ideal place to relax, swim, and enjoy the natural beauty of the coast.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3caf15b0-9024-4cad-a47b-99d0153a09af", "translation" => "La plage d'Aokas est un véritable joyau côtier, offrant un espace spacieux, une eau claire et des paysages à couper le souffle. C'est un endroit idéal pour se détendre, se baigner et profiter de la beauté naturelle de la côte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6a80dcca-ef98-4180-8cfe-28745af9690f", "translation" => "شاطئ أوقاس هو جوهرة ساحلية حقيقية، حيث يقدم مساحة واسعة، ومياهاً واضحة، ومناظر طبيعية خلابة. إنه مكان مثالي للاسترخاء، والسباحة، والاستمتاع بجمال الساحل الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1113
            ["id" => "ca63721f-728a-42ba-aa5d-f0ff1c906dd0", "translation" => "The Oued Djemaa beach is a little coastal treasure offering a welcoming space for swimming and leisure. With its adjacent watercourses and natural atmosphere, this beach is a pleasant place to relax and enjoy its natural beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "eaaddf92-401c-40c3-a8ae-994924a3b6c7", "translation" => "La plage de Oued Djemaa est un petit trésor côtier offrant un espace accueillant pour la baignade et les loisirs. Avec ses cours d'eau limitrophes et son atmosphère naturelle, cette plage est un lieu agréable pour se détendre et profiter de sa beauté naturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3fc6a189-5ae9-4115-81f1-287efff568a6", "translation" => "شاطئ واد جمعة هو كنز ساحلي صغير يقدم مساحة ترحيبية للسباحة والترفيه. مع مياهه الجارية المجاورة وأجوائه الطبيعية، يعتبر هذا الشاطئ مكانًا لطيفًا للاسترخاء والاستمتاع بجماله الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1114
            ["id" => "8e09fa43-194b-4243-902d-fd03197a8ffe", "translation" => "Come and experience moments of entertainment and discovery at Bouteghwa's open-air theater, where culture, music, and theater come together to offer you unique and memorable experiences.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e4fe8a3e-26c8-4393-a94f-0ab5b2d0dd5f", "translation" => "Venez vivre des moments de divertissement et de découverte au théâtre de verdure de Bouteghwa, où la culture, la musique et le théâtre se mêlent pour vous offrir des expériences uniques et mémorables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c78a9768-7c25-4245-be09-5d6a93975661", "translation" => "تعالوا واستمتعوا بلحظات من الترفيه والاكتشاف في مسرح الهواء الطلق بوتغوة, حيث تتداخل الثقافة والموسيقى والمسرح لتقديم لكم تجارب فريدة ولا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1115
            ["id" => "7d7b52b2-92b1-4fc2-a049-63b3ac22fe5d", "translation" => "Offering natural beauty, clear waters, and a peaceful atmosphere, it's an ideal place to relax, enjoy the beach, and rejuvenate.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "40893ff5-f993-446f-8247-d29092807df4", "translation" => "Offrant une beauté naturelle, des eaux claires et une atmosphère paisible. C'est un endroit idéal pour se détendre, profiter de la plage et se ressourcer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "068eaa1a-77fd-4435-9068-229d2ccdc760", "translation" => "بفضل جماله الطبيعي ومياهه الصافية وأجوائه الهادئة، إنه مكان مثالي للاسترخاء والاستمتاع بالشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1116
            ["id" => "087cc818-fe2a-49fa-b741-0c6c82d14ba6", "translation" => "Whether you're looking for a day of relaxation in the sun, alone, with friends, or with family, the Tassift beach will meet all your expectations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "deabbce4-69a7-498e-837e-9275991ef6f6", "translation" => "Que vous soyez à la recherche d'une journée de détente au soleil, seul, entre amis ou en famille, la plage de Tassift répondra à toutes vos attentes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2870e4e2-4354-41cc-b68b-e56d4c20432a", "translation" => "سواء كنتم تبحثون عن يوم من الاسترخاء تحت أشعة الشمس، بمفردكم أو مع الأصدقاء أو العائلة، شاطئ تاسيفت سيلبي جميع توقعاتكم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1117
            ["id" => "a548e344-70cb-4153-b02b-f078646e80d9", "translation" => "The Lamaadhane beach is a true haven of peace where you can rejuvenate, have fun, and enjoy the natural beauty of Tichy's coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1a11fa70-2d5a-4851-b011-870dfc32a7b4", "translation" => "La plage de Lamaadhane est un véritable havre de paix où vous pourrez vous ressourcer, vous amuser et profiter de la beauté naturelle de la côte de Tichy.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b28547e3-fb40-464f-bfbf-bed162b73564", "translation" => "شاطئ المعادن هو ملاذ حقيقي للسلام حيث يمكنكم أن تستعيدوا نشاطكم، تستمتعوا بوقت ممتع و بجمال الساحل في تيشي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1118
            ["id" => "64253cf5-c6b8-46af-8f93-3de8b9110724", "translation" => "The villas beach is a true haven of peace where you can rejuvenate, have fun, and enjoy the natural beauty of the place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d07247d5-0d19-4a53-8f5c-5e8bba92943e", "translation" => "La plage des villas est un véritable havre de paix où vous pourrez vous ressourcer, vous amuser et profiter de la beauté naturelle du lieu.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8fab0bdc-d9e8-4602-8c1b-86edb512f459", "translation" => "شاطئ الفيلات هو ملجأ حقيقي للسلام حيث يمكنك الاسترخاء، والمرح، والاستمتاع بجمال المكان الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1119
            ["id" => "47fc6636-c5b1-49de-b913-74f723627454", "translation" => "The stadium beach offers a tranquil atmosphere and natural charm. Whether you want to relax, swim, or explore the underwater world, this beach provides a peaceful escape by the Mediterranean Sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "75c2c2ce-55a2-442d-92a7-98913a8e0d6d", "translation" => "La plage du stade offre une atmosphère tranquille et un charme naturel. Que vous souhaitiez vous détendre, vous baigner ou explorer les fonds marins, cette plage vous offre une escapade paisible au bord de la mer Méditerranée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1767c743-73fa-4d90-a0be-644fc89254db", "translation" => "شاطئ الملعب يقدم أجواء هادئة وجمالاً طبيعياً. سواء كنت ترغب في الاسترخاء، أو السباحة، أو استكشاف عالم تحت الماء، يقدم لك هذا الشاطئ فرصة للهروب إلى جو هادئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1120
            ["id" => "e6669ae3-69a8-49f3-8b81-3acd993bf84d", "translation" => "The hotel's beach is a beautiful coastal destination that offers a generous expanse of golden sand and clear waters, attracting visitors in search of adventure and relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5ddc9d84-418d-4b99-85b2-cf37b4984aca", "translation" => "La plage des hôtels est une destination côtière magnifique qui offre une étendue généreuse de sable doré et des eaux claires, attirant les visiteurs en quête d'aventure et de détente.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8e01c894-b294-434b-a0d6-fe8713348347", "translation" => "شاطئ الفنادق هو وجهة ساحلية جميلة تقدم مساحة واسعة من الرمال الذهبية ومياه صافية، مما يجذب الزوار الباحثين عن المغامرة والاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1121
            ["id" => "8a3f4852-47a8-4dad-b6b4-e32075554c8e", "translation" => "Whether you want to spend a day with family, organize a picnic with friends, or simply relax on your own, The Hammadites beach offers a generous and diverse space to cater to all preferences.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "754d37ff-bd99-4ce6-83b8-cdd262a49ff7", "translation" => "Que vous souhaitiez passer une journée en famille, organiser un pique-nique entre amis ou simplement vous détendre en solitaire, la plage Les Hammadites offre un espace généreux et varié pour répondre à toutes les envies.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3be75b57-f81d-4110-9266-70c4d443ddeb", "translation" => "سواء كنتم ترغبون في قضاء يوم مع العائلة، أو تنظيم نزهة مع الأصدقاء، أو ببساطة الاسترخاء بمفردكم، شاطئ الحماديين يقدم مساحة وفيرة ومتنوعة لتلبية جميع الاختيارات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1122
            ["id" => "ef766522-cc78-44fa-8d08-988326d89d8b", "translation" => "The Capritour village beach is a lively and welcoming place, offering visitors a pleasant seaside experience. Whether it's for relaxing on the sand, swimming in clear waters, or engaging in water activities, this beach caters to everyone's desires.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "236d7df0-7d33-4edc-8be6-5276951568a9", "translation" => "La plage du village Capritour est un lieu vivant et accueillant, offrant aux visiteurs une expérience balnéaire agréable. Que ce soit pour se détendre sur le sable, se baigner dans les eaux claires ou s'adonner à des activités nautiques, cette plage saura satisfaire les envies de chacun.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "54aee8eb-441d-46a7-9ce6-fd722b2cce1d", "translation" => "شاطئ قرية كابريتور هو مكان حيوي ومرحب، يقدم للزوار تجربة ساحلية ممتعة. سواء كان ذلك للاسترخاء على الرمال، أو السباحة في مياه صافية، أو ممارسة الأنشطة البحرية، يلبي هذا الشاطئ رغبات الجميع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1123
            ["id" => "425d0b55-7263-4c07-80a4-603a3e090d6d", "translation" => "Whether you're seeking peaceful moments in the sun, enchanting nighttime entertainment, or thrilling adventures, the Paradise Beach Club offers a comprehensive experience that surpasses expectations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c2f56c4d-89df-4fdb-ab27-f68c30954c2a", "translation" => "Que vous soyez en quête de moments paisibles au soleil, de divertissements nocturnes envoûtants ou d'aventures excitantes, le Paradise Beach Club offre une expérience complète qui transcende les attentes. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3e08e7c0-6c13-4d0d-9da1-f28ce288af87", "translation" => "سواء كنت تبحث عن لحظات هادئة تحت أشعة الشمس، أو ترفيه ساحر في الليالي، أو مغامرات مثيرة، يقدم بارادايز بيتش كلوب تجربة شاملة تتجاوز التوقعات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1124
            ["id" => "495397f1-689c-4818-aefe-556efa309d0e", "translation" => "The Acherchour beach is appreciated for its peaceful ambiance and tranquil atmosphere, making it an ideal place to escape the stress of daily life. Visitors can relax, read a book, take a nap, or simply admire the beauty of the surrounding nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "24751a6d-307a-4103-976f-067eb56f5455", "translation" => "La plage d'Acherchour est appréciée pour son ambiance tranquille et son atmosphère paisible, ce qui en fait un endroit idéal pour échapper au stress de la vie quotidienne. Les visiteurs peuvent se relaxer, lire un livre, faire une sieste ou simplement contempler la beauté de la nature environnante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "733c1318-78bc-48ee-947b-acf4937d7adb", "translation" => "شاطئ أشرشور مشهور بأجوائه الهادئة وجوه السلام، مما يجعله مكانًا مثاليًا للهروب من ضغوط الحياة اليومية. يمكن للزوار الاسترخاء، وقراءة كتاب، وأخذ قيلولة، أو مجرد التمتع بجمال الطبيعة المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1125
            ["id" => "153e8c87-b6b6-48f8-924a-1b0f47c22ea7", "translation" => "The El Maghra beach is a long, simple sandy beach that offers showers for refreshment and vendors selling snacks and drinks to meet the needs of visitors. It is a conducive place for relaxation, swimming, and contemplation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fcec4ea1-2b0c-4185-89d3-bdd4b8b17deb", "translation" => "La plage d'El Maghra est une longue plage de sable simple qui propose des douches pour se rafraîchir et des vendeurs de collations et de boissons pour satisfaire les besoins des visiteurs. C'est un lieu propice à la détente, à la baignade et à la contemplation.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0465f51d-8b61-4693-9ea5-db6a4af2a412", "translation" => "شاطئ المغرة هو شاطئ طويل من الرمال البسيطة يقدم دشًا لتحديث النفس وبائعين يبيعون وجبات خفيفة ومشروبات لتلبية احتياجات الزوار. إنه مكان مناسب للاسترخاء والسباحة والتأمل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1126
            ["id" => "36f051fb-80af-4305-ad3b-efa26bb2e4cc", "translation" => "Atlantis Beach stands out for its exemplary cleanliness, eliminating concerns related to incivility found elsewhere. It is the perfect place for safe and relaxing vacations, making it a true added value to the coastal tourism of Bejaia.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2a01fcfa-ac9e-49aa-897f-efec8a51aba6", "translation" => "Atlantis Beach se distingue par sa propreté exemplaire, éliminant les soucis liés à l'incivisme ailleurs. C'est l'endroit parfait pour des vacances sûres et relaxantes, ce qui en fait une véritable valeur ajoutée au tourisme balnéaire de Béjaïa.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ef748d09-49ca-4ee7-8a03-437711f3258a", "translation" => "اتلانتيس بيتش يتميز بنظافته المثالية، مما يزيل القلق المتعلق بعدم الالتزام في أماكن أخرى. إنه المكان المثالي لقضاء عطلة آمنة ومريحة، مما يجعله إضافة حقيقية للسياحة الساحلية في بجاية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1127
            ["id" => "1cd22ba9-7182-4e1c-a88d-b2e6df343773", "translation" => "This beach is characterized by its natural and wild appearance. It is bordered by agricultural greenhouses, giving it a unique landscape where nature and agriculture blend harmoniously. The greenhouses are set back from the beach, hidden behind a clump of reeds that adds a touch of natural beauty to the environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fe504d9a-e41f-4245-a3c2-2f8845f2b3de", "translation" => "Cette plage est caractérisée par son aspect naturel et sauvage. Elle est bordée de serres agricoles, ce qui lui confère un paysage particulier où la nature et l'agriculture se mêlent harmonieusement. Les serres sont situées en retrait de la plage, cachées derrière une touffe de roseaux qui ajoute une touche de beauté naturelle à l'environnement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "729b9ce8-a58e-485f-8774-17ffbf49c45d", "translation" => "هذا الشاطئ مميز بمظهره الطبيعي والبري. إنه محاط بالدفيئات الزراعية, مما يمنحه منظرًا فريدًا حيث تتداخل الطبيعة والزراعة بتناغم. تقع الدفيئات الزراعية في موقع متخفي خلف تجمع من أشجار القصب، مما يضيف لمسة من الجمال الطبيعي إلى البيئة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1128
            ["id" => "67c04716-22c8-48c0-bd64-ebc989e9aa3b", "translation" => "The port of Bejaia is much more than just a maritime port. It is a place steeped in history, flavors, and traditions, offering an immersive experience for visitors. Whether you are passionate about sailing, a photography enthusiast, or simply seeking a cultural immersion.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4da2d7a1-126c-4cce-b8a6-a50e2ede2b03", "translation" => "Le port de Béjaïa est bien plus qu'un simple port maritime. C'est un lieu chargé d'histoire, de saveurs et de traditions, offrant une expérience immersive pour les visiteurs. Que vous soyez passionné de navigation, amateur de photographie ou simplement en quête d'une immersion culturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e4f06bcf-1358-4d29-8f7b-7d8ce43c0e22", "translation" => "ميناء بجاية أكثر من مجرد ميناء بحري. إنه مكان غني بالتاريخ والنكهات والتقاليد، ويقدم تجربة غامرة للزوار. سواء كنت مهتمًا بالملاحة، أو عاشقًا للتصوير الفوتوغرافي، أو ببساطة تبحث عن تجربة ثقافية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1129
            ["id" => "355f31eb-ba5b-4541-b94f-f45d3af1261a", "translation" => "Upon your arrival at the Cap Carbon lighthouse, you will be amazed by its imposing silhouette and dominant presence overlooking the ocean. Built in the early 20th century, this lighthouse is not only an architectural masterpiece but also a symbol of navigation and maritime safety.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2558518e-bc61-4b40-902e-6a63e5bec5b2", "translation" => "Dès votre arrivée au phare de Cap Carbon, vous serez émerveillé par sa silhouette imposante et sa présence dominante surplombant l'océan. Construit au début du XXe siècle, ce phare est non seulement une œuvre d'art architecturale, mais aussi un symbole de navigation et de sécurité maritime.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "73f03f57-3f75-4993-8ac8-68e96e34903f", "translation" => "عند وصولك إلى منارة كاب كاربون, ستُدهشك مظهرها الضخم ووجودها السائد فوق سطح المحيط. تم بناؤها في بداية القرن العشرين، وهذه المنارة ليست فقط تحفة معمارية، بل أيضًا رمزًا للملاحة وسلامة الملاحة البحرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1130
            ["id" => "0e6474bf-0d10-4820-a831-d8888ada8bad", "translation" => "The Saket beach offers a beautiful and unique landscape with its pebbles all along the shoreline. It's an ideal place to relax, swim, and enjoy a peaceful seaside ambiance. Prepare your water shoes and come to experience the natural beauty of this beach during your next visit to Bejaia.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "02209086-5b4c-4170-bdbd-bd9009206b41", "translation" => "La plage de Saket offre un paysage magnifique et unique avec ses galets tout le long du rivage. C'est un endroit idéal pour se détendre, se baigner et profiter d'une ambiance paisible en bord de mer. Préparez vos chaussures d'eau et venez profiter de la beauté naturelle de cette plage lors de votre prochaine visite à Béjaïa.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "174c34e1-0095-47e0-9b5a-3e0663cee144", "translation" => "شاطئ ساكت يقدم مناظر طبيعية رائعة وفريدة مع وجود حصى على طول الشاطئ. إنه مكان مثالي للاسترخاء والسباحة والاستمتاع بجو هادئ على الشاطئ. قوموا بإحضار أحذيتكم المائية وتعالوا للاستمتاع بجمال هذا الشاطئ الطبيعي خلال زيارتكم القادمة إلى بجاية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1131
            ["id" => "10e29fa2-7dca-4fb3-bd09-6da3890d8f64", "translation" => "The Tala Yillef marina is an ideal destination for boaters seeking a sailing experience. With its beautiful setting, facilities, and services, this marina provides an unforgettable maritime experience. Whether you're a boater or just looking for a peaceful seaside getaway.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "784f9eec-a931-4ec2-a994-ed2f76f2a1f2", "translation" => "Le port de plaisance de Tala Yillef est un lieu idéal pour les plaisanciers à la recherche d'une expérience de navigation. Avec son cadre magnifique, ses installations et ses services, ce port offre une expérience maritime inoubliable. Que vous soyez un plaisancier ou simplement à la recherche d'une escapade paisible en bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7df74978-7934-4651-b9dd-d178c4187c53", "translation" => "ميناء تالة إيلف هو مكان مثالي لمحبي التجديف الذين يبحثون عن تجربة في الملاحة. مع إطاره الجميل ومرافقه وخدماته، يقدم هذا المرسى تجربة بحرية لا تُنسى. سواء كنتم رواد البحر أم تبحثون فقط عن هروب هادئ على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1132
            ["id" => "e0540495-fd77-49b9-973d-24eef5108342", "translation" => "When you arrive at the Sahel beach, you are immediately captivated by the picturesque landscape that surrounds it. The beach is bordered by a beautiful lush forest and a majestic mountain, creating a peaceful and refreshing atmosphere, perfect for relaxation and rejuvenation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "14211026-6632-48ff-b8c8-ed7006f07e83", "translation" => "Lorsque vous arrivez à la plage Sahel, vous êtes immédiatement captivé par le paysage pittoresque qui l'entoure. La plage est bordée d'une magnifique forêt verdoyante ainsi que d’une montagne majestueuse qui offre une atmosphère paisible et rafraîchissante, idéal pour se détendre et se ressourcer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1b394a2f-bbe8-427d-b7a9-7c7f20047c2b", "translation" => "عندما تصل إلى شاطئ الساحل، ستُسحر على الفور بالمناظر الخلابة التي تحيط به. الشاطئ محاط بغابة خضراء جميلة وجبل مهيب، مما يخلق جوًا هادئًا ومنعشًا، مثاليًا للراحة والاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1133
            ["id" => "7cd16931-570e-4951-8d38-97cf975bb8c8", "translation" => "This amusement park is a dynamic and entertaining place for children, offering a variety of games and activities. In summary, it is an ideal destination for families looking for an outdoor entertainment venue.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9acb15b2-c087-4c0a-8b6e-bfc7cb78a022", "translation" => "Ce parc de loisirs est un endroit dynamique et divertissant pour les enfants, offrant une variété de jeux et d'activités. En somme, une destination idéale pour les familles à la recherche d'un lieu pour se divertir en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c82d0348-c13a-4215-ba8b-f466a16e2690", "translation" => "هذه الحديقة الترفيهية هي مكان دينامي ومسلي للأطفال، حيث تقدم مجموعة متنوعة من الألعاب والأنشطة. بشكل عام، إنها وجهة مثالية للعائلات الباحثة عن مكان للترفيه في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1134
            ["id" => "ed4266a5-81cf-43ce-8191-6a939b7cda58", "translation" => "The square Pasteur is a peaceful and green public space, providing a relaxation spot amidst the urban hustle and bustle. With its benches, well-maintained lawns, and flower beds, it is a cherished destination for locals to recharge and enjoy the beauty of nature right in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3062c9f3-a046-4dbf-a39b-9eb1fc326200", "translation" => "Le Square Pasteur est un espace public paisible et verdoyant, offrant un lieu de détente au milieu de l'agitation urbaine. Avec ses bancs, ses pelouses bien entretenues et ses parterres de fleurs, il constitue une destination appréciée des habitants pour se ressourcer et profiter de la beauté de la nature en plein cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5895cfe9-f358-4124-99d7-18f1dc804cf8", "translation" => "ساحة باستور مكان عام هادئ يقدم مكانًا للاسترخاء في قلب الضجيج الحضري. مع مقاعد الجلوس والحدائق الخضراء المحافظ عليها بعناية ، إنه وجهة محبوبة للمحليين للاسترخاء والاستمتاع بجمال الطبيعة في وسط المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1135
            ["id" => "cf746fa4-d7a7-49d2-9630-fc3d8953a9d2", "translation" => "The Mezaia lake is a lacustrine ecosystem that was created from a former clay quarry used for the production of red bricks. Over time, the excavation of the earth allowed a groundwater aquifer to fill the pit, and a dam was constructed to retain the water.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8528f99b-32ad-41f6-8dad-1e7d01d33383", "translation" => "Le lac Mezaïa est un écosystème lacustre qui a été créé à partir d'un ancien gisement d'argile utilisé pour la production de briques rouges. Au fil du temps, l'excavation de la terre a permis à une nappe phréatique de remplir la fosse, et une digue a été construite pour retenir l'eau.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3b51e623-2c6c-4cd0-949d-eb6156cf7f1c", "translation" => "بحيرة مزايا هي نظام بيئي مائي تم إنشاؤه من محجر طيني سابق كان يُستخدم لإنتاج الطوب الأحمر. مع مرور الوقت، سمح حفر الأرض بامتلاء الحفرة بالمياه الجوفية، وتم بناء سد لاحتجاز المياه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1136
            ["id" => "2688a9a3-99af-4f18-898d-0373adb95d27", "translation" => "The Alivava amusement park is an ideal place for children, offering a variety of attractions suited to their age and interests. With its rides, playgrounds, and various entertainments, the park creates a joyful and stimulating environment where children can fully enjoy their leisure time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c7b9bc8d-deb1-45b8-96cd-c93b4854f138", "translation" => "Le parc de loisirs Alivava est un lieu idéal pour les enfants, offrant une variété d'attractions adaptées à leur âge et à leurs intérêts. Avec ses manèges, ses aires de jeux et ses différents divertissements, le parc crée un environnement joyeux et stimulant où les enfants peuvent profiter pleinement de leurs loisirs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6bfddda2-b71f-4412-bfe2-ca359d48f4a9", "translation" => "حديقة التسلية علي بابا مكان مثالي للأطفال، حيث يقدم مجموعة متنوعة من الأماكن الترفيهية المناسبة لعمرهم واهتماماتهم. من خلال ألعابه ومناطق اللعب والترفيهات المتنوعة، يخلق المنتزه بيئة مبهجة ومحفزة حيث يمكن للأطفال الاستمتاع بوقتهم بشكل كامل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1137
            ["id" => "35c67f23-aeb4-4ed0-a6f6-26f0d6919501", "translation" => "Overall, the Ibourassen garden is a true haven of peace where the beauty of nature blends with the sounds of children's play. It's an ideal place to relax with family, take a stroll, and rejuvenate.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "eb1bb44f-7fcd-4f8e-b9e7-f15fd329a469", "translation" => "Dans l'ensemble, le jardin Ibourassen est un véritable havre de paix où la beauté de la nature se mêle aux bruits des jeux pour enfants. C'est un endroit idéal pour se détendre en famille, se promener et se ressourcer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "120946e5-3637-4db4-be3d-a77770873576", "translation" => "بشكل عام، حديقة إبوراسن هي ملاذ حقيقي للسلام حيث يمتزج جمال الطبيعة بأصوات ألعاب الأطفال. إنها مكان مثالي للاسترخاء مع العائلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1138
            ["id" => "6cc6f3a1-899f-4db4-9855-09e8a989b5d8", "translation" => "The Keffous Hocine zoological park is an ideal place to spend a day with family, combining fun and learning. It's a place where you can admire the beauty of wildlife while developing an awareness of the importance of species conservation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "857e5a0f-0146-49a1-b96d-62f8e09c03d2", "translation" => "Le parc zoologique Keffous Hocine est un endroit idéal pour passer une journée en famille, en combinant l'amusement et l'apprentissage. C'est un lieu où l'on peut admirer la beauté de la faune sauvage tout en développant une prise de conscience de l'importance de la conservation des espèces.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "38c00566-1587-4e06-9014-028f997825fb", "translation" => "حديقة الحيوانات كفوس حسين هي مكان مثالي لقضاء يوم مع العائلة، حيث يمكن دمج المرح والتعلم. إنها مكان يمكنك فيه أن تعجب بجمال الحياة البرية وفي الوقت نفسه توعية نفسك بأهمية الحفاظ على الأنواع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1139
            ["id" => "f9e51099-6bc3-4cd2-8c82-497a1059bb79", "translation" => "The crafts house of Bejaia is a must-visit place for craft enthusiasts and curious individuals eager to explore the history, traditions, and talent of local artisans.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b2a22fd4-c062-42c6-bb21-effaa441e884", "translation" => "La maison de l'artisanat de Béjaïa est un lieu incontournable pour les amateurs d'artisanat et les curieux désireux de découvrir l'histoire, les traditions et le talent des artisans locaux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4ccd8dbd-c470-4564-bd28-2796e58aefe6", "translation" => "دار الصناعة التقليدية في بجاية هو مكان لا غنى عنه لعشاق الحرف اليدوية والفضوليين الراغبين في استكشاف التاريخ والتقاليد ومهارة الحرفيين المحليين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1140
            ["id" => "fd874295-9f0b-4c97-86b9-dbe4bfe57a65", "translation" => "The Ait Falki waterfalls is a favorite destination for nature enthusiasts, hikers, and those seeking a moment of tranquility in a beautiful natural setting. It's a place to rejuvenate and connect with nature while admiring the strength and splendor of the waterfalls.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9c3f45a3-5c6d-4fb8-8dc7-4c1339d41cf1", "translation" => "Les chutes d'Aït Falki sont un lieu de prédilection pour les amoureux de la nature, les amateurs de randonnée et les personnes à la recherche d'un moment de tranquillité au milieu d'un cadre naturel magnifique. C'est un endroit où l'on peut se ressourcer et se connecter avec la nature tout en admirant la force et la splendeur des cascades d'eau.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2994d9fb-b077-41d4-9c32-69e478499465", "translation" => "شلالات آيت فلكاي هي وجهة مفضلة لعشاق الطبيعة ومحبي المشي لمسافات طويلة، ولأولئك الذين يبحثون عن لحظة من السكينة في منتصف إطار طبيعي رائع. إنها مكان يمكنك فيه أن تستعيد نشاطك وتتواصل مع الطبيعة بينما تعجب بقوة وروعة شلالات المياه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1141
            ["id" => "9ab777df-e08d-46bd-8b13-7910d70cefdc", "translation" => "Fort Clauzel is a must-visit for those interested in history and military architecture, providing a captivating glimpse into Bejaia's colonial past and its strategic significance at the time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ceca172e-b707-4efa-ba5d-36ca30f821b9", "translation" => "Le fort Clauzel est un lieu incontournable pour ceux qui s'intéressent à l'histoire et à l'architecture militaire, offrant un aperçu captivant du passé colonial de Béjaïa et de son importance stratégique à l'époque.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a141d427-5777-4461-8e2f-6ef81f8f488d", "translation" => "قلعة كلوزيل هي مكان لا غنى عنه لأولئك الذين يهتمون بالتاريخ والهندسة المعمارية العسكرية، حيث توفر نظرة جذابة إلى الماضي الاستعماري لبجاية وأهميتها الاستراتيجية في ذلك الوقت.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1142
            ["id" => "b240dae7-78ac-4083-bb76-64999ad11ab2", "translation" => "This garden is an enchanting space where nature and entertainment come together. Located in a picturesque setting, this garden provides children with an ideal place to play, have fun, and expend their energy outdoors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5de8869e-6676-4e82-865e-f38e4f43137f", "translation" => "Ce jardin est un espace enchanteur où la nature et le divertissement se rejoignent. Situé dans un cadre pittoresque, ce jardin offre aux enfants un lieu idéal pour jouer, s'amuser et se dépenser en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "43063cbc-bb01-4dba-9f8b-d0a9b75d8231", "translation" => "هذه الحديقة مساحة ساحرة حيث تتلاقى الطبيعة والترفيه. تقع هذه الحديقة في إطار خلاب، وتوفر للأطفال مكانًا مثاليًا للعب والاستمتاع وإنفاق طاقتهم في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1143
            ["id" => "0af4ed41-408c-407a-9010-e185dd9ce96f", "translation" => "Whether you're seeking relaxation, adventure, or just a sunny getaway, the Tighremt beach is a place where you can rejuvenate and enjoy the natural beauty of the Toudja coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cc99ab56-8632-4e6e-b186-b122110631ef", "translation" => "Que vous soyez en quête de détente, d'aventure ou simplement d'une escapade ensoleillée, la plage de Tighremt est un lieu où vous pourrez vous ressourcer et profiter de la beauté naturelle de la côte de Toudja.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d81ca0e0-02a5-4799-89ae-65f31ca9ec72", "translation" => "سواء كنت تبحث عن الاسترخاء، المغامرة، أو مجرد عطلة مشمسة، شاطئ تيغرمت هو مكان يمكنك فيه أن تستعيد نشاطك وتستمتع بجمال الساحل توجة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1144
            ["id" => "aaf08427-3679-487f-acf9-7460b29e1f1a", "translation" => "Whether it's lounging in the sun on the warm sand, swimming in the refreshing sea waters, or indulging in water sports, there's something for everyone at the Timeridjine beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b661e3c1-77de-4f57-9fc5-6f14dc7e65e7", "translation" => "Que ce soit se prélasser au soleil sur le sable chaud, se baigner dans les eaux rafraîchissantes de la mer ou s'adonner à des sports nautiques, il y en a pour tous les goûts à la plage Timeridjine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bcd620df-8ba0-4d68-9ab2-0139041dc3fd", "translation" => "سواء كان الأمر يتعلق بالاسترخاء تحت أشعة الشمس على الرمال الدافئة، أو السباحة في مياه البحر المنعشة، أو ممارسة الرياضات المائية، هناك شيء للجميع على شاطئ تيمريجين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1145
            ["id" => "10dca8fd-51b4-415d-a312-a36bf432714f", "translation" => "The Oued Dass beach is a treasure of wild beauty to discover. It's a little piece of unspoiled paradise that hasn't been overrun by tourists and vacationers yet. Unlike its more famous and crowded neighboring beaches, this one remains undiscovered by holidaymakers, contributing to its tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "befff8f4-e6c3-4b60-8592-7031b5a2f502", "translation" => "La plage d'Oued Dass est un trésor de beauté sauvage à découvrir. C'est un petit coin de paradis préservé qui n'a pas encore été envahi par les touristes et les vacanciers. Contrairement aux plages voisines plus célèbres et prisées, cette plage est encore méconnue des estivants, ce qui contribue à sa tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "485d7c27-3bde-465d-b699-815ae3b0d582", "translation" => "شاطئ واد داس هو كنز من الجمال البري يجب اكتشافه. إنها قطعة صغيرة من الجنة الطبيعية المحافظ عليها ولم تُغزو بعد من قبل السياح والمصطافين. على عكس الشواطئ المجاورة الأكثر شهرة وازدحامًا، مما يسهم في هدوئه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1146
            ["id" => "9ca42c7d-fa08-4d28-82bc-f7ee044aee09", "translation" => "Its privileged position offers visitors a spectacular view of the coast, and the entire site is a reminder of the natural beauty and the significance of navigation in this region. Come and discover the fascinating history of Cap Sigli lighthouse and enjoy this breathtaking view of Algeria's coastal landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "31ca37f9-26f0-4bd2-834d-d08547df53b9", "translation" => "Sa position privilégiée offre aux visiteurs une vue spectaculaire sur la côte, et l'ensemble du site est un rappel de la beauté naturelle et de l'importance de la navigation dans cette région. Venez découvrir l'histoire fascinante du phare de Cap Sigli et profiter de cette vue imprenable sur les paysages côtiers d'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d09ef456-7fe2-4718-b1da-c7e3299312d5", "translation" => "موقعه المتميز يقدم للزوار إطلالة مذهلة على الساحل، والموقع بأكمله يُذكِّر بجمال الطبيعة وأهمية الملاحة في هذه المنطقة. تعالوا واكتشفوا تاريخ منارة رأس سيقلي الرائع واستمتعوا بهذا الإطلالة الرائعة على المناظر الساحلية في الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1147
            ["id" => "986b6ece-55f4-4043-a37b-2b37d253f928", "translation" => "The Ait Mendil beach is a true gem on the coast, providing visitors with an exceptional beach experience. With its vast expanse of sand and pebbles, this beach is perfect for relaxation, swimming, and sunbathing.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "735c308c-7c4b-4c8d-a900-30a395ff4479", "translation" => "La plage d'Aït Mendil est un véritable joyau sur la côte, offrant aux visiteurs une expérience balnéaire exceptionnelle. Avec sa vaste étendue de sable et de galets, cette plage est idéale pour se détendre, se baigner et profiter du soleil.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "19321516-f3ea-43c7-b07d-057d6e8a25b5", "translation" => "شاطئ آيت منديل هو جوهرة حقيقية على الساحل، حيث يوفر للزوار تجربة استثنائية. بفضل مساحته الشاسعة من الرمال والحصى، يعتبر هذا الشاطئ مثاليًا للاسترخاء، و السباحة، والاستمتاع بأشعة الشمس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1148
            ["id" => "e009b1bb-426c-4552-96d1-35c0b3b8de90", "translation" => "Whether you're a sea enthusiast, a seafood lover, or simply seeking an authentic getaway, the port of Beni Ksila will charm you. Come immerse yourself in the unique maritime atmosphere of this charming port and let yourself be captivated by the beauty and authenticity of this fascinating place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ba08c72e-5e88-4e47-9250-da812d52f9e8", "translation" => "Que vous soyez un passionné de la mer, un amateur de fruits de mer ou simplement à la recherche d'une escapade authentique, le port de Beni Ksila saura vous séduire. Venez vous immerger dans l'atmosphère maritime unique de ce charmant port et laissez-vous emporter par la beauté et l'authenticité de cet endroit fascinant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cb9399bf-9624-42bb-80e4-17c01d84fc7c", "translation" => "سواء كنت عاشقًا للبحر، أو محبًا للأطعمة البحرية، أو ببساطة تبحث عن هروب أصيل، سيقع ميناء بني كسيلة في حبك. تعال وانغمس في الجو البحري الفريد لهذا الميناء الجميل واسمح لنفسك بأن تُسحر بجمال وأصالة هذا المكان الساحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1149
            ["id" => "c7e007ec-3e90-48c0-ae43-08e6ba0fcbac", "translation" => "The Forte beach enjoys a good attendance, offering a lively and friendly atmosphere. Whether you're looking for a relaxing day with family or simply a moment of tranquility by the water.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "be30c157-a273-4ece-a017-3d26ddb617f7", "translation" => "La plage Forte jouit d'une bonne fréquentation, offrant une atmosphère animée et conviviale. Que vous soyez à la recherche d'une journée de détente en famille ou simplement d'un moment de tranquillité au bord de l'eau.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2bdeb6ac-e0d4-4935-a17e-b30b2e1b5e69", "translation" => "شاطئ فورت يتمتع بزيارات جيدة، مما يوفر جوًا حيويًا ووديًا. سواء كنت تبحث عن يوم استرخاء مع العائلة أو ببساطة لحظة هدوء على شاطئ الماء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1150
            ["id" => "bf287de5-ce2b-4a54-b6a4-a14e5ce4be49", "translation" => "The Azaghar beach is a popular destination that promises an unforgettable beach experience. With its endless stretch of sand, this beach provides an idyllic setting to relax, rejuvenate, and soak up the sun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c9847e5f-1876-46ac-b1bb-e5b579d4635b", "translation" => "La plage d'Azaghar est une destination prisée qui promet une expérience balnéaire inoubliable. Avec son étendue de sable à perte de vue, cette plage offre un cadre idyllique pour se détendre, se ressourcer et profiter du soleil.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5cccd21d-fc7f-4aa6-898c-f65d39365089", "translation" => "شاطئ أزغار هو وجهة مشهورة تعد بتجربة لا تُنسى. بفضل مساحته الشاسعة من الرمال، يوفر هذا الشاطئ إطارًا جميلاً للاسترخاء، واستعادة النشاط، والتمتع بأشعة الشمس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1151
            ["id" => "2a9f2766-eb92-4599-9ba8-ad2d2e5be422", "translation" => "The Baya amusement park is an ideal place to have a great time with your family. It provides an entertaining and safe experience for children, with a variety of fun and educational activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b0ea77bc-900a-4903-8000-5653c109fa27", "translation" => "Le parc de loisirs Baya est un endroit idéal pour passer du bon temps en famille. Il offre une expérience divertissante et sûre pour les enfants, avec une variété d'activités ludiques et éducatives.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8a41d5f7-d9da-4087-94f2-50a4b746775c", "translation" => "حديقة التسلية باية هي مكان مثالي لقضاء وقت ممتع مع العائلة. إنها تقدم تجربة مسلية وآمنة للأطفال، بمجموعة متنوعة من الأنشطة الترفيهية والتعليمية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1152
            ["id" => "6e770fe1-4856-4cc7-80ec-e9f048e0759a", "translation" => "Whether you're a nature lover, an adventure enthusiast, or simply seeking a peaceful escape from the fast pace of daily life, the Ighzer Ouftis dam is the perfect place for you. Come immerse yourself in the natural beauty, enjoy water activities, and discover the many facets of this iconic location.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e4402f6f-4705-4973-b3c5-2f0eea9effdf", "translation" => "Que vous soyez un amoureux de la nature, un passionné d'aventure ou simplement à la recherche d'un endroit paisible pour échapper au rythme effréné de la vie quotidienne, le barrage Ighzer Ouftis est l'endroit parfait pour vous. Venez vous plonger dans la beauté naturelle, profiter des activités aquatiques et découvrir les multiples facettes de ce lieu emblématique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "06e046bc-f3f4-40e2-89ab-2a867bd64c4f", "translation" => "سواء كنت عاشقًا للطبيعة، أو مغامرًا متحمسًا، أو ببساطة تبحث عن مكان هادئ للهروب من وتيرة الحياة اليومية المثيرة، فإن سد إغزر أوفتيس هو المكان المثالي بالنسبة لك. تعال وانغمس في الجمال الطبيعي، واستمتع بالأنشطة المائية، واكتشف العديد من جوانب هذا الموقع الأيقوني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1153
            ["id" => "b76d6c01-b222-4a11-b267-22102937314e", "translation" => "We invite you to come and discover the benefits of the Assif el Hammam thermal spa and relax in a naturally soothing environment. Whether you're looking for thermal treatments, a relaxing getaway, or simply a unique experience, Assif el Hammam will meet your expectations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a54b2c14-ae8c-4b4a-af75-3037e9fb9e4e", "translation" => "Nous vous invitons à venir découvrir les bienfaits de la station thermale Assif el Hammam et à vous détendre dans un cadre naturellement apaisant. Que vous recherchiez des soins thermaux, une évasion relaxante ou simplement une expérience unique, Assif el Hammam saura répondre à vos attentes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "aa34afa9-2d31-47f7-968b-1fb373807662", "translation" => "ندعوكم لاكتشاف فوائد منتجع اسيف الحمام والاسترخاء في بيئة تهدئة طبيعية. سواء كنتم تبحثون عن علاجات حرارية أو عن تجربة استرخاء أو حتى مجرد تجربة فريدة، فإن اسيف الحمام ستلبي توقعاتكم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1154
            ["id" => "7271ff7f-4ecc-4200-8a9f-f7b052bb6066", "translation" => "This site once housed the residence of one of the heirs of the Berber king Nubel, which was unfortunately destroyed during his son Firmus' rebellion against Roman authority at the end of the 4th century.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "15a2d374-0d36-4930-b847-d71b0fde8b94", "translation" => "Ce site abritait autrefois la résidence d'un des héritiers du roi berbère Nubel, qui fut malheureusement détruite lors de la révolte de son fils Firmus contre l'autorité romaine à la fin du IVe siècle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "54443ed4-969d-4788-b590-3ffa70c4cf4a", "translation" => "هذا الموقع كان يضم في السابق إقامة أحد ورثة الملك البربري نوبيل، والتي تم تدميرها للأسف خلال تمرد ابنه فيرموس ضد السلطة الرومانية في نهاية القرن الرابع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1155
            ["id" => "10e28a28-669a-4e2a-aa8b-6ae4275039e0", "translation" => "Whether you are seeking adventure, relaxation, or natural discoveries, the Agoulmim n'Iker lake is the perfect place to rejuvenate and marvel at the preserved beauty of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9d32e467-c498-433b-bf80-d4abef5d06b2", "translation" => "Que vous soyez en quête d'aventure, de détente ou de découvertes naturelles, le lac Agoulmim n'Iker est l'endroit idéal pour vous ressourcer et vous émerveiller devant la beauté préservée de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5229180e-0a18-4964-83b3-82db2b48315d", "translation" => "سواء كنتم تبحثون عن المغامرة، الاسترخاء، أو اكتشافات طبيعية، فإن بحيرة أقولميم نيكر هي المكان المثالي لتجديد نشاطكم والإعجاب بجمال الطبيعة المحافظة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1156
            ["id" => "87b6e936-7eb7-460a-9024-d2d7c83ba956", "translation" => "Come and discover this remarkable hydraulic structure and admire its imposing construction. Enjoy the panoramic view of the artificial lake formed by the dam and explore the natural surroundings that make it a suitable place for relaxation and contemplation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "535cacd1-76dd-46f3-8f2f-1eb3998249fb", "translation" => "Venez découvrir ce remarquable ouvrage hydraulique et admirez sa construction imposante. Profitez de la vue panoramique sur le lac artificiel formé par le barrage et explorez les environs naturels qui en font un lieu propice à la détente et à la contemplation.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7e7bd63e-afa8-49f8-89cf-fe4f0516b1dd", "translation" => "تعالوا واكتشفوا هذا البنية الهيدروليكية الرائعة واعجبوا ببنيتها الضخمة. استمتعوا بالمنظر البانورامي للبحيرة الاصطناعية التي تشكلت بفعل السد واكتشفوا المناطق الطبيعية المحيطة التي تجعلها مكانًا مناسبًا للراحة والتأمل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1157
            ["id" => "0e091776-f319-404f-8137-551360d3666c", "translation" => "Whether you're looking for a relaxing experience, a spa retreat, or a culinary getaway, the Sidi Yahia thermal resort will meet your expectations. Come and enjoy this haven of peace and let yourself be enchanted by the magic of the place. A stay here will offer you an unforgettable experience where you can take care of yourself while discovering the wonders of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d6dd9cc7-c8f7-4f1f-9caf-787d1d25731d", "translation" => "Que vous soyez à la recherche d'une expérience relaxante, d'une cure thermale ou d'une escapade culinaire, la station thermale de Sidi Yahia saura répondre à vos attentes. Venez profiter de ce havre de paix et laissez-vous emporter par la magie des lieux. Un séjour ici vous offrira une expérience inoubliable, où vous pourrez prendre soin de vous tout en découvrant les merveilles de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "77b0be40-d51d-42c2-8c22-919d776c9672", "translation" => "سواء كنتم تبحثون عن تجربة مريحة، أو علاجات حرارية، أو هروب للتذوق الطهي، فإن منتجع سيدي يحيى سيكون جاهزًا لتلبية توقعاتكم. تعالوا واستمتعوا بهذا ملاذ السلام واسمحوا لأنفسكم بالسحر الذي ينطوي عليه هذا المكان. ستقدم لكم إقامة هنا تجربة لا تُنسى، حيث يمكنكم العناية بأنفسكم واكتشاف عجائب المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1158
            ["id" => "2dfd6aa9-a2d3-4158-a913-0a78d544d82a", "translation" => "Surrounded by lush vegetation and green hills, the Ouroufal lake offers an enchanting landscape where the blue water glistens in the sunlight. Nature enthusiasts will be delighted by the diversity of landscapes and the richness of the region's fauna and flora.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "45c38367-26be-4ed6-8091-7b428572303f", "translation" => "Entouré d'une végétation luxuriante et de collines verdoyantes, le lac Ouroufal offre un paysage enchanteur où l'eau bleue miroite sous le soleil. Les amateurs de nature seront comblés par la diversité des paysages et la richesse de la faune et de la flore de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "31fbdc5f-b782-4ccc-b0c4-08a6e9fb778d", "translation" => "محاطًا بنباتات خصبة وتلال خضراء، تقدم بحيرة اوروفال مناظر ساحرة حيث تتألق المياه الزرقاء تحت أشعة الشمس. سيكون عشاق الطبيعة مسرورين بتنوع المناظر وثراء الحياة البرية والنباتية في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1159
            ["id" => "8ad782ee-a1fd-4d58-8377-6b7f5950506b", "translation" => "Whether you're looking for family entertainment, a diverse culinary experience, or the opportunity to celebrate significant moments, the Green Land Park Akfadou is the perfect place to have a pleasant and relaxing time of entertainment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4130e688-f6db-48f1-af2c-3f860bf180b1", "translation" => "Que vous recherchiez des divertissements en famille, une expérience culinaire variée ou la possibilité de célébrer des moments importants, le Green Land Park Akfadou est l'endroit idéal pour passer un agréable moment de détente et de divertissement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7cca11e6-6779-4450-b5fe-b33ea3c6ed17", "translation" => "سواء كنتم تبحثون عن ترفيه للعائلة، تجربة ثقافية متنوعة، أو فرصة للاحتفال بلحظات مهمة، فإن حديقة غرين لاند بارك أكفادو هي المكان المثالي لقضاء وقت ممتع مليء بالاسترخاء والتسلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1160
            ["id" => "4dcbe08e-7979-42ef-bb5a-a7f22f294ad6", "translation" => "The Ighil Emda dam is not only a place of technical interest but also an attractive tourist site. Visitors can admire the majesty of the structure, enjoy the surrounding natural beauty, and learn about ongoing hydroelectric activities. It is an ideal place for nature enthusiasts, engineering enthusiasts, and those who want to learn more about the history and development of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8bde1dbf-a2e0-41c1-823a-4292ca6a94e1", "translation" => "Le barrage d'Ighil Emda constitue non seulement un lieu d'intérêt technique, mais aussi un site touristique attrayant. Les visiteurs peuvent admirer la majesté de la structure, profiter de la beauté naturelle environnante et découvrir les activités hydroélectriques en cours. C'est un endroit idéal pour les amateurs de nature, les passionnés d'ingénierie et ceux qui souhaitent en apprendre davantage sur l'histoire et le développement de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ba08e76f-2230-45f6-9ac2-f612396a5256", "translation" => "سد إيغيل أمدة ليس مكانًا فقط ذا أهمية تقنية، ولكنه أيضًا موقع سياحي جاذب. يمكن للزوار أن يعجبوا بعظمة الهيكل، ويستمتعوا بجمال الطبيعة المحيطة، إنه مكان مثالي لعشاق الطبيعة، وعشاق الهندسة، وأولئك الذين يرغبون في التعرف على تاريخ وتطوير المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1161
            ["id" => "19d182aa-e11a-410a-917c-1421e3085b92", "translation" => "The Laalam waterfalls are a true natural treasure waiting to be discovered. With their stunning beauty, tranquil ambiance, and preserved natural surroundings, they provide a perfect getaway for nature lovers, hikers, and photography enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "67e00bb8-fffa-4055-8f52-ba9535b031e6", "translation" => "Les chutes de Laalam sont un véritable trésor naturel qui ne demande qu'à être découvert. Avec leur beauté saisissante, leur ambiance apaisante et leur environnement naturel préservé, elles offrent une escapade parfaite pour les amoureux de la nature, les randonneurs et les amateurs de photographie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c7f30e1f-c1bc-437b-b2d6-c3dd57cdba40", "translation" => "شلالات لعلام هي كنز طبيعي حقيقي ينتظر الاكتشاف. بفضل جمالها الرائع، وجوها الساحر، والبيئة الطبيعية المحفوظة، توفر هذه الشلالات هروبًا مثاليًا لعشاق الطبيعة، والمتجوّلين، وعشاق التصوير.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1162
            ["id" => "db515406-73ad-48a7-a68b-9d063c8fbffc", "translation" => "The Little Paradise beach stands out for its cleanliness, making it an ideal place to relax and swim. Furthermore, the waters are not deep, making it safe and suitable for children.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b899b69c-487d-4feb-b86d-560f833db0dd", "translation" => "La plage du petit Paradis se distingue par sa propreté, ce qui en fait un endroit idéal pour se détendre et se baigner. De plus, les eaux ne sont pas profondes, ce qui la rend sûre et adaptée aux enfants.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f67f4bb6-3834-4c35-907e-f9cf98240418", "translation" => "شاطئ الجنة الصغيرة يتميز بنظافته، مما يجعله مكانًا مثاليًا للاسترخاء والسباحة. علاوة على ذلك، المياه ليست عميقة، مما يجعلها آمنة ومناسبة للأطفال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1163
            ["id" => "c8623f9b-88a9-4043-8f03-7425277600b3", "translation" => "The broken boat beach is a true natural gem that invites visitors to recharge and lose themselves in the beauty of its landscape. Whether you're in search of relaxation, adventure, or simply an unforgettable getaway, this beach offers a unique experience not to be missed.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "89b30fe8-1509-49a0-8fb8-e7b697d6ddfa", "translation" => "La plage du Bateau Cassé est un véritable joyau naturel qui invite les visiteurs à se ressourcer et à se perdre dans la beauté de son paysage. Que vous soyez en quête de détente, d'aventure ou simplement d'une escapade inoubliable, cette plage vous offre une expérience unique à ne pas manquer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9a5b3bc9-2354-4981-a68d-cce3bed8e786", "translation" => "شاطئ القارب المكسور هو جوهرة طبيعية حقيقية تدعو الزوار للاسترخاء والانغماس في جمال مناظرها. سواء كنتم تبحثون عن الاسترخاء، المغامرة، أو مجرد هروب لا يُنسى، يقدم هذا الشاطئ تجربة فريدة لا يجب تفويتها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1164
            ["id" => "23ca4bbb-4b36-48b4-812d-bbd730b2c67c", "translation" => "Located along the coast, the Tilmatine beach offers a picturesque landscape where the blue of the sea harmoniously blends with the golden sand. It's the perfect place to relax, swim, and enjoy the sun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "36da3978-3119-404d-9741-c03e186a7697", "translation" => "Située le long de la côte, la plage Tilmatine offre un paysage pittoresque où le bleu de la mer se mêle harmonieusement au sable doré. C'est l'endroit idéal pour se détendre, se baigner et profiter du soleil.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "05c405a2-556b-4a57-bf0e-ccc544966deb", "translation" => "تقع شاطئ تيلماتين على طول الساحل، ويقدم مناظر طبيعية خلابة حيث يمتزج اللون الأزرق للبحر بانسجام مع الرمال الذهبية. إنه المكان المثالي للاسترخاء، و السباحة، والاستمتاع بأشعة الشمس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1165
            ["id" => "fb9b40ca-ede8-416e-96bf-96bfbab8f726", "translation" => "The fishing port of Azeffoun is an authentic and picturesque place that invites visitors to discover the local maritime life and savor culinary delights made from seafood.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "89aa9f78-7a9e-4677-bd56-0f9b723894a8", "translation" => "Le port de pêche d'Azeffoun est un lieu authentique et pittoresque qui invite les visiteurs à découvrir la vie maritime locale et à savourer des délices culinaires à base de produits de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "676710e5-21fc-437d-baca-8c485e9f2eb1", "translation" => "ميناء صيد أزفون هو مكان أصيل وجميل يدعو الزوار لاكتشاف حياة البحر المحلية والتمتع بأطباق لذيذة مصنوعة من منتجات البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1166
            ["id" => "7a710451-ae20-4c74-bddc-0ea492dc5bfa", "translation" => "The central beach has many attractive features, including its extensive space, granular sand, and shallow depth, making it a popular destination for summer visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "03935831-b288-4088-89db-0da5e29e6edd", "translation" => "La plage du centre offre de nombreux atouts attrayants, tels que son vaste espace, son sable granuleux et sa profondeur limitée, ce qui en fait un lieu apprécié des estivants.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ebe56b11-d5e2-498f-95ba-6ca7639021e9", "translation" => "شاطىء الوسط يحتوي على العديد من الميزات الجاذبة، مثل مساحته الواسعة والرمال الحبيبية والعمق المحدود، مما يجعله وجهة محببة لزوار فصل الصيف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1167
            ["id" => "919cb5f2-b220-4b5a-80ff-45429698cd90", "translation" => "The Carob beach is a beautiful family beach that offers everything you need for a pleasant day by the sea. It has dedicated lifeguards, restaurants for dining, and facilities with showers for added comfort.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "69f0fc79-88c3-419f-aa57-db3f3c97465e", "translation" => "La plage du Caroubier est une magnifique plage familiale qui offre tout ce dont vous avez besoin pour passer une journée agréable au bord de la mer. Elle dispose de plagistes dédiés, de restaurants pour se restaurer et de sanitaires avec des douches pour plus de confort.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e90a4aa4-02b1-4b12-b68a-2f2a1abdcdff", "translation" => "شاطئ الخروب هو شاطئ جميل للعائلات يوفر كل ما تحتاجه لقضاء يوم ممتع على شاطئ البحر. يتوفر به حراس شاطئ مخصصون، ومطاعم, ومرافق تتضمن دشًا لزيادة الراحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1168
            ["id" => "f93510ca-5870-400e-bed1-778e5b62dd36", "translation" => "The Tazaghart beach is a true gem, offering visitors a unique beach experience. This picturesque beach is situated in a preserved natural setting, providing breathtaking landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5922b26f-f5a1-4df6-9bba-92c032a85871", "translation" => "La plage de Tazaghart est une véritable perle, offrant aux visiteurs une expérience balnéaire unique. Cette plage pittoresque est située dans un cadre naturel préservé, offrant des paysages à couper le souffle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3468d5c7-b543-476d-8f38-d9d7e0631b0f", "translation" => "شاطئ تازاغارت هو لؤلؤة حقيقية تقدم للزوار تجربة فريدة على الشاطئ. يقع هذا الشاطئ الخلاب في إطار طبيعي محافظ، مما يوفر مناظر خلابة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1169
            ["id" => "176b1735-3c01-4ef1-ae58-542ec08dcba4", "translation" => "The Tazaghart 2 beach is relatively quiet and less crowded, making it an ideal place for those seeking tranquility and privacy. You can enjoy moments of absolute relaxation, far away from the hustle and bustle of daily life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8d712154-54a6-457a-8155-ca322c276ff6", "translation" => "La plage Tazaghart 2 est relativement calme et peu fréquentée, ce qui en fait un lieu idéal pour ceux qui recherchent la tranquillité et l'intimité. Vous pourrez profiter de moments de détente absolue, loin de l'agitation de la vie quotidienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1292a07e-bab9-4ed4-a7a8-56913d00ad41", "translation" => "شاطئ تازاغارت 2 هادئ نسبياً، مما يجعله مكانًا مثاليًا لأولئك الذين يبحثون عن الهدوء. يمكنكم الاستمتاع بلحظات من الاسترخاء المطلق، بعيدًا عن صخب الحياة اليومية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1170
            ["id" => "0f0c917e-a3ca-4dbe-86cd-39d0fdbfbd00", "translation" => "Sidi Korchi is a true natural spectacle, with its impressive rock formations that add a touch of uniqueness and beauty to the landscape. Whether you're a photography enthusiast, a curious explorer, or simply seeking a picturesque setting to relax, this place will undoubtedly awe you with its natural splendor.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "21bfcfa6-edc7-4904-a754-4f679d720eec", "translation" => "Sidi Korchi est un véritable spectacle naturel, avec ses formations rocheuses impressionnantes qui ajoutent une touche d'originalité et de beauté à l'ensemble. Que vous soyez un amateur de photographie, un explorateur curieux ou simplement à la recherche d'un cadre pittoresque pour vous détendre, ce lieu ne manquera pas de vous émerveiller par sa splendeur naturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d6f2b661-5b3a-485f-a07d-b5a533512195", "translation" => "سيدي قرشي هو عرض طبيعي حقيقي، بتضاريسه الصخرية الرائعة التي تضيف لمسة من الفرادة والجمال للمنطقة بأكملها. سواء كنت هاويًا للتصوير، مستكشفًا فضوليًا، أو مجرد بحثك عن بيئة جميلة للاسترخاء، فإن هذا المكان لن يتركك دون إعجاب بروعته الطبيعية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1171
            ["id" => "e75d06ea-5a90-49da-9d81-57d121f402d2", "translation" => "While the sand quality may be average, the Feraoun “East” beach has an authentic charm that sets it apart from other beaches in the region. Its low crowds ensure a more peaceful experience, perfect for escaping the crowd and rejuvenating to the soothing sound of the waves.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "79e5acf0-afad-4354-9f71-e33a93c30b3e", "translation" => "Bien que le sable puisse être de qualité moyenne, la plage de Feraoun “Est” possède un charme authentique qui la distingue des autres plages de la région. Son faible affluence vous garantit une expérience plus paisible, idéale pour échapper à la foule et vous ressourcer au son apaisant des vagues.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "08332c51-8147-4777-aec6-e5eea00e0bf4", "translation" => "على الرغم من أن جودة الرمال قد تكون متوسطة، إلا أن شاطئ فرعون ”شرق“ يتميز بسحر أصيل يميزه عن الشواطئ الأخرى في المنطقة. انخراط الزوار المنخفض يضمن لك تجربة أكثر هدوءًا، مما يجعلها مثالية للابتعاد عن الزحام والاسترخاء على إيقاع مريح للأمواج.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1172
            ["id" => "e23f3e48-9beb-46a7-8d21-65f589047759", "translation" => "The Sidi Khaled beach offers visitors an intimate and peaceful seaside experience. Despite its modest size, this beach has a unique charm that makes it a popular destination for nature lovers and those seeking tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0530754f-5887-4d19-a38d-ea10dbe04bc8", "translation" => "La plage de Sidi Khaled offre aux visiteurs une expérience intime et paisible au bord de la mer. Bien que sa taille soit modeste, cette plage possède un charme unique qui en fait une destination prisée des amoureux de la nature et des amateurs de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "20e9bdce-420b-47fe-9e45-003ed56a0fbe", "translation" => "شاطئ سيدي خالد يقدم للزوار تجربة حميمة وهادئة على شاطئ البحر. على الرغم من حجمه المتواضع، إلا أن هذا الشاطئ يمتلك سحرًا فريدًا يجعله وجهة مشهورة لعشاق الطبيعة والباحثين عن الهدوء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1173
            ["id" => "b63c600d-3828-4b96-9c8d-b070fbb4cbea", "translation" => "The Avechar beach is a tranquil place where you can enjoy the natural beauty of the coast. Its crystal-clear waters and soothing ambiance make it a popular destination for those seeking relaxation away from the crowd.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "51095069-6b88-458e-a73f-fbf67aaf9fc3", "translation" => "La plage d'Avechar est un endroit tranquille où vous pourrez profiter de la beauté naturelle de la côte. Ses eaux cristallines et son ambiance apaisante en font une destination prisée par ceux qui cherchent à se détendre loin de la foule.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9e0f1e4c-58f8-4054-aeeb-314fd0646546", "translation" => "شاطئ ابشار هو مكان هادئ حيث يمكنكم الاستمتاع بجمال الطبيعة على الساحل. مياهه الصافية وجوه السكينة تجعله وجهة مفضلة لأولئك الذين يبحثون عن الاسترخاء بعيدًا عن الزحام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1174
            ["id" => "0c43616b-5dc1-4871-889a-4845af7aae28", "translation" => "While the sand quality may not be the best, the Feraoun West beach compensates with its tranquility and natural charm. It's a place where you can relax in peace, far away from the stress of daily life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fe03314e-47eb-4f6e-814a-41a3205cf14d", "translation" => "Bien que le sable puisse ne pas être de la meilleure qualité, la plage de Feraoun Ouest compense par sa tranquillité et son charme naturel. C'est un lieu où vous pourrez vous ressourcer en toute quiétude, loin du stress de la vie quotidienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ee5311d1-ba6c-4786-ac94-d89319057436", "translation" => "على الرغم من أن جودة الرمال قد لا تكون الأفضل، إلا أن شاطئ فرعون الغربي يعوض ذلك بهدوئه وسحره الطبيعي. إنه مكان يمكنك فيه أن تستريح بسلام، بعيدًا عن ضغوط الحياة اليومية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1175
            ["id" => "e2c64727-d96c-46d4-8854-1f821f7772a1", "translation" => "The big beach is a popular and lively destination during the summer season. With its expanse of sand, clear waters, and a range of nearby facilities, this beach offers a dynamic and enjoyable seaside experience for all those looking to soak up the sun and the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "abc45793-7752-4f69-a15c-fa2342705677", "translation" => "La grande plage est une destination populaire et animée pendant la saison estivale. Avec son étendue de sable, ses eaux claires et sa gamme d'installations à proximité, cette plage offre une expérience balnéaire dynamique et agréable pour tous ceux qui souhaitent profiter du soleil et de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "238eb9cd-595b-4dde-9116-edbdf79633aa", "translation" => "الشاطئ الكبير هو وجهة مشهورة وحية خلال موسم الصيف. بفضل مساحته الرملية الواسعة ومياهه الصافية وتوفر مجموعة من المرافق القريبة، يقدم هذا الشاطئ تجربة بحرية ديناميكية وممتعة لكل من يرغب في الاستمتاع بأشعة الشمس والبحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1176
            ["id" => "f114bf54-3390-45ea-89b4-0674a69f5fe2", "translation" => "The Tigzirt marina is a must-visit destination for sailing and boating enthusiasts. With its modern facilities, friendly atmosphere, and strategic location on the coast, it provides a unique and enjoyable maritime experience for all boaters looking to explore the beauty of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0ae6e929-e1f6-47a9-8744-4f795c798527", "translation" => "Le port de plaisance de Tigzirt est un lieu incontournable pour les passionnés de navigation et de plaisance. Avec ses installations modernes, son ambiance conviviale et sa position stratégique sur la côte, il offre une expérience maritime unique et agréable pour tous les plaisanciers qui souhaitent explorer la beauté de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d0baf2aa-b746-4759-bc04-ffb2195e93bc", "translation" => "ميناء تيقزيرت هو مكان لا غنى عنه لعشاق الملاحة والرياضات البحرية. بفضل مرافقه الحديثة وجوه الود الذي يسوده وموقعه الاستراتيجي على الساحل، يوفر تجربة بحرية فريدة وممتعة لجميع الأشخاص الذين يتطلعون إلى استكشاف جمال المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1177
            ["id" => "3936ef11-9ae9-4c7b-937c-f11755d68769", "translation" => "Due to its appeal and popularity, the Tassalast beach experiences significant crowds during the summer. Vacationers and locals gather to enjoy the sun, play in the sand, and swim in the refreshing waters.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6d5de61a-d190-4935-b345-f0d073fd818a", "translation" => "En raison de son attrait et de sa popularité, la plage de Tassalast connaît une affluence importante pendant l'été. Les vacanciers et les habitants se rassemblent pour profiter du soleil, jouer dans le sable et se baigner dans les eaux rafraîchissantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "da6d1d27-a923-4b8b-a44a-532a51a2bffd", "translation" => "نظرًا لجاذبيتها وشهرتها، يشهد شاطئ تاسلاست ازدحامًا كبيرًا خلال فصل الصيف. يتجمع العطلاء والسكان المحليين للاستمتاع بأشعة الشمس، واللعب في الرمال، والسباحة في المياه المنعشة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1178
            ["id" => "ffd89677-bdb5-433f-b800-a35b0534942b", "translation" => "The Tiza beach is a destination in itself for nature lovers and those who appreciate unique landscapes. With its tranquil atmosphere and wild beauty, this beach offers an unforgettable experience for those looking to connect with nature and get lost in the spectacular scenery.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "669e315c-aca3-4064-b7a4-768c506b1f50", "translation" => "La plage de Tiza est une destination à part entière pour les amoureux de la nature et les amateurs de paysages uniques. Avec son atmosphère tranquille et sa beauté sauvage, cette plage offre une expérience inoubliable pour ceux qui cherchent à se connecter avec la nature et à se perdre dans les paysages spectaculaires.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9916ecce-914b-4575-8313-ebf58883bb18", "translation" => "شاطئ تيزا هو وجهة متكاملة بالنسبة لعشاق الطبيعة وعشاق المناظر الفريدة. بفضل جوهره الهادئ وجماله البري، يقدم هذا الشاطئ تجربة لا تُنسى لأولئك الذين يتطلعون إلى التواصل مع الطبيعة والانغماس في المناظر الخلابة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1179
            ["id" => "31ebfd77-71c8-4b54-a3c2-94002cb576d8", "translation" => "Discover the Rock 40, a legendary place located near the village of Mazer. A perfect destination for rejuvenation in the heart of nature, close to the sea and a beautiful forest, ideal for enjoying an unforgettable camping getaway.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ecfe7640-4c39-4280-89e0-102e61746a32", "translation" => "Découvrez le Rocher 40, un lieu mythique situé près du village Mazer. Une destination parfaite pour se ressourcer en pleine nature, à proximité de la mer et d'une forêt magnifique, idéale pour profiter d'une escapade inoubliable en camping.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "855e8bd6-499c-4d49-b7a2-4c9f9a5354e6", "translation" => "اكتشفوا الصخرة 40، مكانًا أسطوريًا يقع بالقرب من قرية مازر. وجهة مثالية للاسترخاء في قلب الطبيعة، بالقرب من البحر وغابة جميلة، مثالية للاستمتاع برحلة تخييم لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1180
            ["id" => "b8e17705-4d12-447f-be36-d5b453be12c6", "translation" => "This monument commemorates the martyrs who sacrificed their lives for freedom and independence, a poignant symbol of resistance and courage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3b5d32f9-cad7-4b3e-b886-1cd219ee9cc9", "translation" => "Ce monument commémore les martyrs qui ont sacrifié leur vie pour la liberté et l'indépendance, symbole poignant de résistance et de courage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "02ffd1db-6db8-403a-afd2-3dbd2174ed79", "translation" => "هذا النصب التذكاري يخلد ذكرى الشهداء الذين قدموا أرواحهم من أجل الحرية والاستقلال، رمز مؤثر للمقاومة والشجاعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1181
            ["id" => "ddebc376-0c28-4245-9ab4-32fb99a232ba", "translation" => "The Octopus water park is an ideal place to spend a pleasant afternoon with your family. Pools suitable for all ages, the cleanliness of the park, attentive supervision by the staff, and satisfying food make it an attractive destination for water fun enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1307ba2a-9609-453e-9a96-2afbe6ff4a22", "translation" => "Le parc aquatique Octopus est un lieu idéal pour passer un après-midi agréable en famille. Les piscines adaptées à tous les âges, la propreté du parc, la surveillance attentive des agents et la nourriture satisfaisante en font une destination attrayante pour les amateurs d'amusement aquatique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f7255f9f-011d-4680-87bd-44e0c01ee13e", "translation" => "حديقة الأخطبوط المائية مكان مثالي لقضاء بعض الوقت الممتع مع العائلة. حمامات السباحة المناسبة لجميع الأعمار، نظافة المنتزه، مراقبة مستمرة من قبل العاملين، وتوفير طعام يجعله وجهة جذابة لعشاق المرح المائي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1182
            ["id" => "e23a29bb-d0c0-4fd1-9543-073a32f2ccee", "translation" => "Whether you're a nature lover, a photography enthusiast, or simply seeking a peaceful getaway, the Draa el Mizane dam promises you a memorable experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7daf42e1-a10f-4895-b296-3ac654d582f6", "translation" => "Que vous soyez un amoureux de la nature, un passionné de photographie ou simplement à la recherche d'une escapade paisible, le Barrage de Draa el Mizane vous promet une expérience mémorable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7a784114-7231-40f8-93ce-f0b6fdb9948e", "translation" => "سواء كنت من عشاق الطبيعة، أو عاشقي التصوير، أو مجرد من يبحثون عن استراحة هادئة، سد ذراع الميزان يعدك بتجربة لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1183
            ["id" => "487b7257-fe6f-4cc1-8d18-c212e49444ca", "translation" => "The Taksebt dam is surrounded by breathtaking landscapes, featuring imposing mountains and lush valleys. You can take a stroll along its shores, soak in the serenity of the water, and enjoy the panoramic views of the surroundings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a74c39cc-d9ad-4026-ade0-45ecaf640a2d", "translation" => "Le barrage de Taksebt est entouré de paysages à couper le souffle, avec des montagnes imposantes et des vallées verdoyantes. Vous pourrez vous promener le long de ses rives, vous imprégner de la tranquillité de l'eau et profiter de la vue panoramique sur les environs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5173dd4b-e38d-42c6-a6b8-feda4d76557e", "translation" => "سد تاقسبت محاط بمناظر خلّابة، حيث تتميز بجبالها الرائعة والوديان الخضراء. يمكنك التجول على طول شواطئه، والاستمتاع بسكينة المياه، والاستمتاع بالمناظر البانورامية للمناطق المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1184
            ["id" => "9684961f-1890-46e4-9300-bb2566220ddb", "translation" => "The Tirourda pass, located at an impressive altitude of 1740 meters, offers an unforgettable experience to visitors who dare to venture into this preserved corner. Nestled in the heart of the majestic Djurdjura mountains, this pass reveals breathtaking panoramas that captivate the gaze and leave a memorable impression on those who contemplate it. The view from this dizzying altitude embraces a landscape of exceptional beauty, with expansive greenery as far as the eye can see.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "724a5199-c666-4299-95bd-77471ab56c44", "translation" => "Le Col de Tirourda, situé à une altitude impressionnante de 1740 mètres, offre une expérience inoubliable aux visiteurs qui osent s'aventurer dans ce coin préservé. Niché au cœur des majestueux monts du Djurdjura, ce col dévoile des panoramas époustouflants qui captivent le regard et laissent une empreinte mémorable dans l'esprit de ceux qui le contemplent. La vue depuis cette altitude vertigineuse embrasse un paysage d'une beauté exceptionnelle, offrant une verdure étendue à perte de vue.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ae17aeae-6c83-49c0-89bf-660134c97929", "translation" => "ممر تيروردا, الواقع على ارتفاع مذهل يبلغ 1740 مترًا، يقدم تجربة لا تُنسى للزوار الذين يجرؤون على المغامرة في هذه المنطقة المحمية. متواجدًا في قلب جبال جرجرة  المهيبة، يكشف هذا الممر مناظر طبيعية رائعة تأسر النظر وتترك انطباعًا لا يُنسى في ذهن الذين يتأملونه. الرؤية من هذا الارتفاع المذهل تشمل منظرًا طبيعيًا من جمال استثنائي، مع توفير مناظر خضراء واسعة تمتد حتى الأفق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1185
            ["id" => "0c12841c-c665-418a-b7c2-d064012d6aff", "translation" => "This work of art pays tribute to the memory of Lalla Fatma Nsoumer and underscores her historical significance. It inspires admiration and respect for this exceptional woman who fiercely defended the freedom and dignity of her people.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1c3fc748-109a-4187-9ead-22e36e8de361", "translation" => "Cette œuvre d'art rend hommage à la mémoire de Lalla Fatma Nsoumer et souligne son importance historique. Elle suscite l'admiration et le respect envers cette femme exceptionnelle qui a défendu farouchement la liberté et la dignité de son peuple.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4a1f6292-b4d4-4bb0-84f4-bac602b14ce5", "translation" => "هذا العمل الفني يكرم ذكرى لالة فاطمة نسومر ويسلط الضوء على أهميتها التاريخية. إنه يثير الإعجاب والاحترام نحو هذه الامرأة الاستثنائية التي دافعت بشراسة عن حرية وكرامة شعبها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1186
            ["id" => "7e8ab421-d8d3-47f9-be3f-610c745ba44f", "translation" => "The annex is designed to promote and celebrate the arts in all their forms. Equipped with versatile rooms, exhibition spaces, and performance areas, it provides a vibrant venue for local and regional artists.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ebb2a202-1934-474c-85cf-96bc73fa6c22", "translation" => "L'annexe est conçue pour promouvoir et célébrer les arts sous toutes leurs formes. Dotée de salles polyvalentes, d’espaces d'exposition et de performance, elle offre un lieu vibrant pour les artistes locaux et régionaux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2d9239a0-29d3-43bb-9b9b-de8db11289be", "translation" => "الملحق مصمم لتعزيز والاحتفال بالفنون بجميع أشكالها. يتميز بغرف متعددة الاستخدامات وأماكن للعرض والأداء، وهو يوفر مكانًا حيويًا للفنانين المحليين و الإقليميين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1187
            ["id" => "4edf387c-b097-4517-8406-72f912018526", "translation" => "Whether you want to relax, take a break in the middle of your sightseeing, or simply enjoy nature, the Mohand Oulhadj garden is a must-visit place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cd9dbd8d-26b7-4656-bbef-c45379b51a63", "translation" => "Que vous souhaitiez vous détendre, faire une pause au milieu de vos visites touristiques ou simplement profiter de la nature, le jardin Mohand Oulhadj est un lieu à ne pas manquer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a1e17415-cb45-447b-8f24-35682b1e7ea4", "translation" => "سواء كنت ترغب في الاسترخاء، أو في أخذ استراحة في منتصف جولاتك السياحية، أو ببساطة الاستمتاع بالطبيعة، فإن حديقة محند أولحاج هي مكان يجب عدم تفويته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1188
            ["id" => "08247bc6-401a-43d4-9309-7842a1df9ceb", "translation" => "Don't miss the opportunity to discover this natural treasure; the Green lake of Yakourene is a place where nature and tranquility embrace you, providing a true escape from urban life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "301f0896-bf2c-48a1-8e71-c0a3c60cc017", "translation" => "Ne manquez pas l'opportunité de découvrir ce trésor naturel, le Lac Vert de Yakourene est un lieu où la nature et la tranquillité vous enveloppent, vous offrant un véritable échappatoire de la vie urbaine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "945cd7ea-0f26-40b4-b0db-dd06137a7dd8", "translation" => "لا تفوت فرصة اكتشاف هذا الكنز الطبيعي. بحيرة إعكوران الخضراء هي مكان حيث تحتضنك الطبيعة والهدوء، ممنحة لك فرصة حقيقية للهروب من حياة المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1189
            ["id" => "6adcda17-5ec8-4f35-b17c-a2b441ad7412", "translation" => "The Mahvouva dam is a must-visit destination for discovery and adventure enthusiasts. Nestled in the picturesque region of Ouaguenoun, this majestic dam serves as the primary source of irrigation for the vast agricultural lands that surround it.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bb50b3b9-28b4-4f1d-b350-bff31ae430b2", "translation" => "Le barrage de Mahvouva est une destination incontournable pour les amateurs de découverte et d'aventure. Niché dans la région pittoresque de Ouaguenoun, ce barrage majestueux constitue la principale source d'irrigation des vastes terrains agricoles qui l'entourent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0d0f6686-31c8-4fa3-82ec-2e1f5b251cef", "translation" => "سد محبوبة هو وجهة لا غنى عنها لعشاق الاكتشاف والمغامرة. يتموضع هذا السد الرفيع في المنطقة الخلابة لواقنون، وهو يُعتبر المصدر الرئيسي للري للأراضي الزراعية الشاسعة التي تحيط به.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1190
            ["id" => "461ee9d0-47b5-41a5-a30a-9e91c3181b76", "translation" => "Whether you choose to visit it in winter for a unique experience in the winter cold or at any other time of the year, the Akfadou antenna lake promises you an extraordinary adventure. Prepare to be amazed by the pristine nature and create unforgettable memories in this place that is sure to charm you.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d627a7e7-a05a-4353-83d5-fb85ab643b84", "translation" => "Que vous choisissiez de vous y rendre en hiver, pour une expérience unique dans le froid hivernal, ou à tout autre moment de l'année, le lac de l'antenne d'Akfadou vous promet une aventure extraordinaire. Préparez-vous à vous émerveiller devant la nature intacte et à créer des souvenirs inoubliables dans ce lieu qui ne manquera pas de vous charmer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "53f666b5-ab5f-4dd8-867f-280133b96360", "translation" => "سواء اخترت الذهاب إليها في فصل الشتاء لتجربة فريدة في البرد الشتوي، أو في أي وقت آخر من العام، تعد بحيرة أكفادو مكانًا يعدك بمغامرة استثنائية. قم بالتحضير للإنبهار أمام الطبيعة الخلابة وصنع ذكريات لا تُنسى في هذا المكان الذي سيسحرك بالتأكيد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1191
            ["id" => "081b128c-fd9d-4a50-b8a9-65c1a8c43ddf", "translation" => "If you're ready to take on the challenge and venture into this hidden oasis, you will be rewarded with the discovery of a place of exceptional beauty. Tamda Ouchbali is the perfect place to get lost in nature, relax to the soothing sound of flowing water, and create unforgettable memories in the heart of a pristine natural landscape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "de18199f-5f07-423a-a5a7-381742fd53f0", "translation" => "Si vous êtes prêt à relever le défi et à vous aventurer dans cette oasis cachée, vous serez récompensé par la découverte d'un lieu d'une beauté exceptionnelle. Tamda Ouchbali est l'endroit idéal pour se perdre dans la nature, se détendre au son apaisant de l'eau qui s'écoule et créer des souvenirs inoubliables au cœur d'un paysage naturel préservé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "55e67501-7bc7-4e9e-b6ce-3e21f582900b", "translation" => "إذا كنتم مستعدين للتحدي والمغامرة في هذا الواحة المخفية، فسوف تكون مكافأة بمكتشف مكان ذو جمال استثنائي. تمدا أوشبالي هو المكان المثالي للانغماس في الطبيعة، والاسترخاء تحت صوت المياه المتدفقة المهدئ، وصنع ذكريات لا تُنسى في قلب منظر طبيعي نقي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1192
            ["id" => "5a0721fb-fe0a-4d44-b35f-d6d8907c25c3", "translation" => "Discover Tinzart, the legendary spring of the Djurdjura national park, located near the picturesque village of N'Ath Ali. This mysterious fountain, nestled in the heart of the mountains, offers a unique experience to all visitors seeking extraordinary landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "82acf6e2-4860-4f49-972f-ac75ef0f9b7a", "translation" => "Découvrez Tinzart, la source légendaire du parc national du Djurdjura, située à proximité du pittoresque village de N'Ath Ali. Cette fontaine mystérieuse, nichée au cœur des montagnes, offre une expérience unique à tous les visiteurs en quête de paysages hors du commun.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4775d2af-21b6-4fe8-b13a-c89f8ac6c5a7", "translation" => "اكتشف تينزارت، الينبوع الأسطوري في الحظيرة الوطنية جرجرة، الذي يقع بالقرب من القرية الخلابة ناث علي. هذا الينبوع الغامض، الموجود في قلب الجبال، يقدم تجربة فريدة لجميع الزوار الذين يبحثون عن مناظر طبيعية استثنائية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1193
            ["id" => "4cd568cc-f117-4cfb-aeb3-8181b39949d4", "translation" => "Whether it's to celebrate a birthday or spend a day with family, the Lina amusement park is the perfect place to create unforgettable memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d5877b87-d505-4a9f-85e8-ec4ab89a1780", "translation" => "Que ce soit pour fêter un anniversaire ou passer une journée en famille, le parc d’attractions Lina est l'endroit idéal pour créer des souvenirs inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "74a7b998-2701-40f2-820b-3f45d24ed4cd", "translation" => "سواء كان ذلك للاحتفال بعيد ميلاد أو قضاء يوم مع العائلة، يعتبر متنزه لينا للتسلية المكان المثالي لخلق ذكريات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1194
            ["id" => "d26bd7cf-d34c-4542-83fd-8a7a3fc33048", "translation" => "The ancient site of Laafayer is a captivating place where immense monolithic rock blocks rest, strangely reminiscent of the remnants of the ancient Roman city of Tigzirt. Exploring this site, each stone bears witness to an incredibly rich past and history.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6aca6c37-abf9-4b0d-8c01-ddab1406cbb6", "translation" => "Le site antique de Laafayer est un lieu captivant où d'immenses blocs rocheux monolithiques reposent, évoquant étrangement les vestiges de l'ancienne cité romaine de Tigzirt. En parcourant ce site, chaque pierre témoigne d'un passé et d'une histoire incroyablement riches.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "84f4d03b-e643-4d85-9439-e7af46513b70", "translation" => "موقع لعفاير الأثري هو مكان مثير حيث تستريح كتل صخرية ضخمة منفردة، تشب بشكل غريب ببقايا القديمة من مدينة تيقزيرت الرومانية القديمة. أثناء استكشاف هذا الموقع، تشهد كل حجر على ماضٍ غني وتاريخ مذهل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1195
            ["id" => "a7a6a09a-629d-46ec-a7d5-904c7d15ffe4", "translation" => "Whether you're a history enthusiast, a knowledge seeker, or simply curious to learn more about this great personality, a visit to the Krim Belkacem museum is a must.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c5004526-e423-4589-b1e9-f221645e564b", "translation" => "Que vous soyez passionné d'histoire, chercheur de connaissances ou simplement curieux d'en apprendre davantage sur cette grande personnalité, une visite au musée Krim Belkacem est un incontournable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9aba2501-1277-4213-9a8f-9a476b499a9b", "translation" => "سواء كنت عاشقًا للتاريخ، أو بحثًا عن المعرفة، أو مجرد فضولي للتعرف على المزيد عن هذا الشخصية العظيمة، فإن زيارة متحف كريم بلقاسم أمر لا بد منه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1196
            ["id" => "f3ff8d62-2fdf-40a5-bf94-edb35d0e7306", "translation" => "Whether you're a history enthusiast, an admirer of Colonel Amirouche, or simply curious to explore the cultural heritage of the region, this statue is a powerful symbol worth contemplating.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "336958ba-cc30-4936-a13b-76084ab57f56", "translation" => "Que vous soyez un passionné d'histoire, un admirateur du Colonel Amirouche ou simplement curieux de découvrir le patrimoine culturel de la région, cette statue est un symbole puissant qui mérite d'être contemplé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f113f6d3-f1a8-49b6-b1ea-ef923ec2125f", "translation" => "سواء كنت مهتمًا بالتاريخ، أو معجبًا بالعقيد عميروش، أو مجرد فضولي لاستكشاف التراث الثقافي للمنطقة، فإن هذا التمثال هو رمز قوي يستحق التأمل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1197
            ["id" => "95a5e40f-70f6-445a-ba8c-7b4afbed418d", "translation" => "Tamda Ousserghi is an enchanting site located at the foot of snow-capped mountains in winter and bathed in sunlight in summer. It is one of the few tourist attractions in this mountainous region, offering an unforgettable experience to visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9b0dd028-0a88-4da4-8364-a655d1542d46", "translation" => "Tamda Ousserghi est un site enchanteur situé au pied des montagnes enneigées en hiver et baigné de soleil en été. C'est l'une des rares attractions touristiques de cette commune montagneuse, offrant une expérience inoubliable aux visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b7f4ca40-54ac-4157-a6b1-40d64be6ed72", "translation" => "تامدة أوسرغي هو موقع ساحر يقع في قاعدة الجبال المغطاة بالثلوج في الشتاء والشمس في الصيف. إنها واحدة من المعالم السياحية في هذه البلدة الجبلية، وتقدم تجربة لا تُنسى للزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1198
            ["id" => "55d9accf-9175-4d72-8755-463d5ab91cdd", "translation" => "This place is ideal for families looking to cool off, replenish with drinking water, and admire the beauty of the surrounding nature. Hiking is highly popular in this region, especially the trail leading to lake Aguelmim.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c5a97fad-7d17-416f-abb7-fae12a43000a", "translation" => "Cet endroit est idéal pour les familles qui souhaitent se rafraîchir, se ressourcer avec de l'eau potable et admirer la beauté de la nature environnante. Les randonnées pédestres sont très populaires dans cette région, en particulier le sentier menant au lac Aguelmim.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2e687c85-dc0c-4779-9389-462e831f9077", "translation" => "هذا المكان مثالي للعائلات الراغبة في التبريد والاستراحة مع مياه صالحة للشرب والاستمتاع بجمال الطبيعة المحيطة. رياضة المشي لمسافات طويلة شهيرة جدًا في هذه المنطقة، خاصةً المسار الذي يؤدي إلى بحيرة أقلميم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1199
            ["id" => "e0a7a7b7-3081-4bcd-9622-c40f81f8435a", "translation" => "Whether you're looking for moments of relaxation, aquatic adventures, or simply a peaceful seaside getaway, the Lahsar beach promises you an unforgettable experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d2f75bad-9c56-4d12-acdd-044bfee586ca", "translation" => "Que vous soyez à la recherche de moments de détente, d'aventures aquatiques ou simplement d'une escapade paisible en bord de mer, la plage de Lahsar vous promet une expérience inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f0eb6be8-6feb-46aa-924d-6f8584186445", "translation" => "سواء كنتم تبحثون عن لحظات استرخاء أو مغامرات مائية أو مجرد هروب هادئ على شاطئ البحر، فإن شاطئ لحصار يعدكم بتجربة لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1200
            ["id" => "045ec81e-1e49-471a-9b41-a2736830b6f6", "translation" => "The Salines beach stands out with its vast expanse of fine sand that stretches as far as the eye can see. The clear waters of the sea gently kiss the shore, inviting swimmers to immerse themselves in invigorating coolness.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "587e8449-adf1-42db-961a-1a1ea4e80472", "translation" => "La plage des Salines se distingue par son étendue de sable fin qui s'étend à perte de vue. Les eaux claires de la mer viennent caresser doucement le rivage, invitant les baigneurs à se plonger dans une fraîcheur revigorante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "431d0345-e0af-4638-959c-6dc7dff33b96", "translation" => "شاطئ صالين يتميز بامتداد رماله الناعمة الشاسعة التي تمتد إلى ما لا نهاية. تأتي مياه البحر الصافية لتلامس بلطف شاطئ الساحل، داعية السباحين إلى الانغماس في برودة منعشة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1201
            ["id" => "9d11838e-7bd7-493d-8445-87e48350e008", "translation" => "Whether you're a seafood lover, a photography enthusiast, or simply curious to explore local maritime life, the fishing port of Dellys is a must-visit place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d640248e-c0aa-4856-9f89-e79ec20b6fef", "translation" => "Que vous soyez un amateur de fruits de mer, un passionné de photographie ou simplement curieux de découvrir la vie maritime locale, le port de pêche de Dellys est un lieu incontournable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "635d6a2f-305b-4032-a11d-b821fab5e5a4", "translation" => "سواء كنت من عشاق أطعمة البحر، أو هاوي تصوير، أو مجرد فضولي يرغب في استكشاف الحياة البحرية المحلية، ميناء دلّس للصيد هو مكان لا بد من زيارته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1202
            ["id" => "5ef45b86-23b3-4fc1-b9a7-7bbec5788a28", "translation" => "Upon your arrival at the port, you will be greeted by the hustle and bustle of fishermen returning from their sea trips, bringing with them an abundance of fresh fish. The colorful boats lined along the shore add a picturesque touch to the scene.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "37703bd0-e608-4de6-aa2e-e5d9cdeb712f", "translation" => "Dès votre arrivée au port, vous serez accueilli par l'effervescence des pêcheurs qui rentrent de leur sortie en mer, ramenant avec eux une abondance de poissons frais. Les bateaux colorés, alignés le long du rivage, ajoutent une touche pittoresque à l'ensemble.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c8ee0fe9-3744-4cea-8a3f-841212efce66", "translation" => "عند وصولك إلى الميناء، ستُستقبلك حماسة الصيادين العائدين من رحلاتهم في البحر، حيث يحملون معهم وفرة من الأسماك الطازجة. القوارب الملونة المصطفة على طول الشاطئ تضيف لمسة جميلة إلى المشهد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1203
            ["id" => "90de63ca-a6b6-468f-b76c-4d8b970d000e", "translation" => "The Sidi Abdelkader point lighthouse is a majestic emblem that lights up the coastal waters of the region. It provides a stunning view of the sea and serves as a crucial landmark for sailors navigating along this coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3f0047e3-4e5f-4a27-a6f9-17151d20a109", "translation" => "Le Phare de la pointe Sidi Abdelkader est un emblème majestueux qui illumine les eaux côtières de la région. Il offre une vue imprenable sur la mer et constitue un repère essentiel pour les marins naviguant le long de cette côte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6ee05a49-4657-4dd0-8c16-f8b0b9340eee", "translation" => "منارة سيدي عبد القادر هي رمز جليل يضيء مياه الساحل في هذه المنطقة. إنها تقدم إطلالة رائعة على البحر وتعتبر علامة مهمة للملاحين الذين يجتازون هذا الساحل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1204
            ["id" => "8ae74e74-1eea-4798-9249-177c05889ad8", "translation" => "The Mayouya's rocky beach is a true oasis for those looking to escape the daily hustle and connect with raw and wild nature. Come rejuvenate in this preserved setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "01ee860f-cf0f-456d-a74d-77d101a8429c", "translation" => "La plage rocheuse de Mayouya est une véritable oasis pour ceux qui cherchent à s'évader de l'agitation quotidienne et à se connecter à la nature brute et sauvage. Venez vous ressourcer dans ce cadre préservé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9cd41375-7d8e-474e-ae65-c6febafba2c4", "translation" => "شاطئ ميويا الصخري هو واحة حقيقية لأولئك الذين يبحثون عن الهروب من الزحام اليومي والاتصال بالطبيعة البرية والمتجددة. تعالوا للاسترخاء في هذا البيئة المحمية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1205
            ["id" => "e07dd4db-fb79-4bbe-9598-629de1df5215", "translation" => "Far from traditional sandy beaches, the Tala Waldoune's rocky beach offers a captivating landscape with its rugged cliffs stretching to the sea. The waves gently crash against the rocks, creating a soothing symphony for those who venture near.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "08b8718f-2c5e-49a9-8169-9a235ed9f64b", "translation" => "Loin des plages de sable traditionnelles, la plage rocheuse de Tala Waldoune offre un paysage fascinant avec ses rochers escarpés qui s'étendent jusqu'à la mer. Les vagues viennent se briser doucement contre les rochers, créant une symphonie apaisante pour ceux qui s'aventurent à ses abords.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8524d297-b377-4efd-9a72-69ec081bb86a", "translation" => "بعيدًا عن الشواطئ الرملية التقليدية، يقدم شاطئ تالا والدون مناظر مذهلة مع صخوره الشاهقة التي تمتد حتى البحر. الأمواج تندفع بلطف على الصخور، مما يخلق سيمفونية مهدئة لأولئك الذين يجرؤون على الاقتراب.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1206
            ["id" => "503324b9-6638-4c4d-9548-065bc5a82da5", "translation" => "Whether you're a swimming enthusiast, a lover of coastal landscapes, or simply seeking moments of relaxation by the sea, the Tagdemt beach in Dellys is an ideal place to escape the daily routine and rejuvenate.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f97bbbf3-bd8d-4380-98bc-0a09581aca51", "translation" => "Que vous soyez un amateur de baignade, un passionné de paysages côtiers ou simplement en quête de moments de détente au bord de la mer, la plage de Tagdemt à Dellys est un endroit idéal pour échapper au quotidien et se ressourcer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b6eaeb71-3235-486f-801c-0234dfbf6dca", "translation" => "سواء كنت من عشاق السباحة، أو عاشقي المناظر الساحلية، أو مجرداً بحثًا عن لحظات الاسترخاء على شاطئ البحر، شاطئ تاقدمت في دلس هو مكان مثالي للهروب من الروتين اليومي والاستجمام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1207
            ["id" => "84558f78-8fe3-4975-b750-8f56286ee83a", "translation" => "The Sahel Bouberak beach is renowned for its soft sand that stretches over a large expanse. The clear waters of the sea blend harmoniously with the shoreline, creating a beautiful palette of colors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ab87dd77-dea8-4a1f-be2d-d06ae1b36f3c", "translation" => "La plage de Sahel Bouberak est réputée pour son sable doux qui s'étend sur une grande étendue. Les eaux claires de la mer se mêlent harmonieusement au rivage, créant une palette de couleurs magnifique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "38ea1377-dc80-40c2-8142-b5ca9b3185d0", "translation" => "شاطئ ساحل بوبراك مشهور برماله الناعمة التي تمتد على مساحة واسعة. تمتزج مياه البحر الصافية بانسجام مع الساحل، مما يخلق لوحة ألوان رائعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1208
            ["id" => "5a30fa24-ff74-4ee1-97f9-45ec35975cfe", "translation" => "Whether you're with family or friends, the Blue beach offers an idyllic setting to enjoy the sun, the sea, and the serenity of the surrounding nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aa8ecea9-482c-416d-a074-ccc5eaf41d2c", "translation" => "Que vous soyez en famille ou entre amis, la plage Bleue offre un cadre idyllique pour profiter du soleil, de la mer et de la sérénité de la nature environnante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7f947fcc-6562-4169-af47-3af7c82eb11e", "translation" => "سواء كنتم مع العائلة أو الأصدقاء، يقدم الشاطئ الأزرق طابعًا جميلًا للاستمتاع بالشمس والبحر وهدوء الطبيعة المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1209
            ["id" => "2bc1f8c5-079a-4e53-85c3-37537b437fc3", "translation" => "The Souanine beach is a true coastal gem that provides an exceptional beach experience to visitors seeking relaxation and natural beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "37995def-13d5-4091-b4b4-ebd9fb220e3e", "translation" => "La plage Souanine est un véritable joyau côtier qui offre une expérience balnéaire exceptionnelle aux visiteurs en quête de détente et de beauté naturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4b1ed41a-cd85-40b8-b85c-deffd1e45349", "translation" => "شاطئ السوانين هو جوهرة ساحلية حقيقية تقدم تجربة شاطئ استثنائية للزوار الباحثين عن الاسترخاء والجمال الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1210
            ["id" => "52a2c2a3-2c07-4b34-b72e-8f17a2ee9730", "translation" => "The beach also offers spectacular panoramic views of the sea. Sunsets seen from the Broken boat beach are particularly impressive, painting the sky with warm hues and creating a magical atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "038f4c44-9de0-4e52-b19a-2032f1b882c0", "translation" => "La plage offre également des vues panoramiques spectaculaires sur la mer. Les couchers de soleil vus depuis la plage Bateau Cassé sont particulièrement impressionnants, peignant le ciel de teintes chaudes et créant une atmosphère magique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ea004626-290f-4eaa-8843-13dc222a593d", "translation" => "الشاطئ يوفر أيضًا إطلالات بانورامية رائعة على البحر. الغروب الشمسي المشاهد من شاطئ القارب المكسور لا سيما مبهرة، حيث يرسم السماء بألوان دافئة ويخلق أجواء ساحرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1211
            ["id" => "02b6d3eb-d1b2-4f3f-b442-fcad388fdca5", "translation" => "Whether you're seeking tranquility, natural beauty, or simply a moment of relaxation by the sea, the Mazer beach offers you an authentic and unspoiled beach experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8a33d879-4850-45a7-b3f9-ff1e450598ac", "translation" => "Que vous recherchiez la tranquillité, la beauté naturelle ou simplement un moment de détente au bord de la mer, la plage Mazer vous offre une expérience balnéaire authentique et préservée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5f61121b-86df-4533-b177-0d7babb03d8b", "translation" => "سواء كنتم تبحثون عن السكينة، الجمال الطبيعي، أو مجرد لحظة استرخاء على شاطئ البحر، شاطئ مازر يقدم لكم تجربة شاطئية أصيلة ومحافظة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1212
            ["id" => "7dc86ad6-f9bf-42f2-9712-5a84c432a876", "translation" => "Whether you're a boat enthusiast, a seafood lover, or simply in search of an authentic maritime setting, the Cap Djinet port is a must-visit place. Immerse yourself in the maritime atmosphere, observe the port activities, and be charmed by the picturesque charm of this seaside port.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2e03be78-2c57-44cb-9644-4782b1c29d5b", "translation" => "Que vous soyez un passionné de bateaux, un amateur de fruits de mer ou simplement à la recherche d'un cadre maritime authentique, le port de Cap Djinet est un lieu incontournable. Venez vous immerger dans l'ambiance maritime, observer les activités portuaires et vous laisser séduire par le charme de ce port pittoresque en bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "73f8e6a6-7e74-41ba-9d87-195af095cabb", "translation" => "سواء كنت عاشقًا للقوارب، أو عاشقًا لأطعمة البحر، أو مجردًا بحثًا عن إعداد بحري أصيل، ميناء كاب جنات هو مكان يجب زيارته. تمتع بالانغماس في الجو البحري، ومشاهدة الأنشطة البحرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1213
            ["id" => "6d455613-5306-423f-bdcc-a95a86709226", "translation" => "Whether you're with family or friends, the Cap Djinet beach is a perfect place to relax, have fun, and enjoy the beauty of the sea. Come lounge on the sand, dive into the clear waters, and soak up the relaxing atmosphere of this picturesque beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b80c7ee1-9742-4fc8-b5a3-3c426ee82ed5", "translation" => "Que vous soyez en famille ou entre amis, la plage de Cap Djinet est un lieu parfait pour se détendre, se divertir et profiter de la beauté de la mer. Venez vous prélasser sur le sable, plonger dans les eaux claires et vous imprégner de l'atmosphère relaxante de cette plage pittoresque.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "684a6dfa-a583-4b5b-9c89-becd5a48ae88", "translation" => "سواء كنتم مع العائلة أو الأصدقاء، شاطئ كاب جنات هو المكان المثالي للاسترخاء، والمرح، والاستمتاع بجمال البحر. تعالوا انغمسوا على رمال الشاطئ، وغوصوا في المياه الصافية، واستمتعوا بالجو المريح لهذا الشاطئ الخلاب.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1214
            ["id" => "d1c2c099-b95a-428c-a1ec-7285a8ac734c", "translation" => "Whether you're with family or friends, the Djinet dam is a must-visit destination. Come and enjoy the tranquility, natural beauty, and water activities that this enchanting place has to offer.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ec7edb76-f819-4666-a8c3-4f0cfccddf8b", "translation" => "Que vous soyez en famille ou entre amis, le barrage de Djinet est un lieu incontournable à visiter. Venez profiter de la tranquillité, de la beauté naturelle et des activités aquatiques qui s'offrent à vous par ce lieu enchanteur.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b18cae10-315b-42e3-b0d1-a983beac306f", "translation" => "سواء كنتم مع العائلة أو الأصدقاء، سد جنات هو وجهة لا غنى عنها للزيارة. تعالوا واستمتعوا بالهدوء والجمال الطبيعي والأنشطة المائية التي تتيحها لك هذا المكان الساحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1215
            ["id" => "a4bf6f99-3cf3-4a0b-948c-2914f777115a", "translation" => "The Sidi Daoud dam is the perfect place to rejuvenate in nature. You can stroll along its banks, relax on the fresh grass, and admire the serenity of the surroundings. It's a true haven of peace where you can escape the hustle and bustle of daily life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4cfca6e3-2dd4-43a8-8824-d5fcb2b4cca5", "translation" => "Le barrage de Sidi Daoud est l'endroit idéal pour se ressourcer en pleine nature. Vous pourrez vous promener le long de ses rives, vous détendre sur l'herbe fraîche et admirer la sérénité des lieux. C'est un véritable havre de paix où vous pourrez échapper à l'agitation de la vie quotidienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "45c0bb31-d21f-4583-80fa-6dc96cde290e", "translation" => "سد سيدي داود هو المكان المثالي للاستجمام في الطبيعة. يمكنك التجول على طول شواطئه، والاسترخاء على العشب الطازج، والاستمتاع بهدوء المكان. إنه ملاذ حقيقي للسلام حيث يمكنك الهروب من صخب الحياة اليومية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1216
            ["id" => "09ef4a4d-2356-4922-b828-6fdb0e1218d1", "translation" => "The Mandoura Koudiet el Arais beach is a true coastal treasure known for its unique natural setting. Its shoreline is bordered by a vast dune belt that spans over a kilometer in width and stretches for more than 4 kilometers along the coast.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "555e38d4-e7cd-4cd4-8d61-60d307c63c89", "translation" => "La plage Mandoura Koudiet el Arais est un véritable trésor côtier qui se distingue par son cadre naturel unique. Sa façade littorale est délimitée par un vaste cordon dunaire qui s'étend sur plus d'un kilomètre de largeur et s'étire sur une distance de plus de 4 km le long de la côte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8a7da6cf-2ab3-4b92-95c5-a7f626f88c32", "translation" => "شاطئ مندورة كدية العرايس هو كنز ساحلي حقيقي يتميز بإعداده الطبيعي الفريد. يتم تحديده على الساحل بواسطة حزام رمالي واسع يمتد على مساحة تزيد عن كيلومتر واحد في العرض ويمتد لمسافة تزيد عن 4 كيلومترات على طول الساحل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1217
            ["id" => "80ad2abf-9d6c-43f9-a5aa-55d7485266db", "translation" => "The Zemmouri fishing port is an authentic place where maritime activity meets natural beauty. This port offers a lively and picturesque atmosphere, as well as a unique maritime experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "04b0179b-bd3e-4f97-ab9a-b30c5a491587", "translation" => "Le port de pêche de Zemmouri est un lieu authentique où l'activité maritime rencontre la beauté naturelle. Ce port offre une atmosphère animée et pittoresque, ainsi qu'une expérience maritime unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b6d0c5ee-0476-417d-a9d2-56b4555977e6", "translation" => "ميناء الصيد زموري هو مكان أصيل حيث تلتقي النشاطات البحرية بالجمال الطبيعي. يقدم هذا الميناء أجواء حية وجميلة، بالإضافة إلى تجربة بحرية فريدة من نوعها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1218
            ["id" => "bac3c87a-25eb-4d7d-b5ae-f41b11885fbd", "translation" => "The Zemmouri beach is a true paradise for families and swimming enthusiasts. With its calm and shallow water, this beach is extremely suitable for children, making it a perfect place to relax and swim safely.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b1db072c-bb07-44b8-a0d2-c5aebf37a0da", "translation" => "La plage de Zemmouri est un véritable paradis pour les familles et les amateurs de baignade. Avec son eau calme et peu profonde, cette plage est extrêmement adaptée aux enfants, ce qui en fait un lieu parfait pour se détendre et se baigner en toute sécurité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e15f3532-de15-4ea3-86f9-d2d85f673433", "translation" => "شاطئ زموري هو ملاذ حقيقي للعائلات وعشاق السباحة. بمياهه الهادئة والضحلة، يعد هذا الشاطئ ملائمًا للغاية للأطفال، مما يجعله مكانًا مثاليًا للاسترخاء والسباحة بأمان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1219
            ["id" => "176bb4c7-a92d-4f07-8819-71115669382a", "translation" => "Whether you're with family, friends, or simply looking to enjoy a relaxing day at the beach, the Sghirat beach is a perfect choice. Come and enjoy the clear water and friendly atmosphere in one of the region's finest spots.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8a54782b-50b4-4966-8ad5-5b4aef1e161b", "translation" => "Que vous soyez en famille, entre amis ou que vous souhaitiez simplement profiter d'une journée relaxante à la plage, la plage de Sghirat est un choix parfait. Venez profiter de l'eau claire, de l'atmosphère conviviale dans l'un des meilleurs endroits de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c7ab7011-2f1e-4102-938f-61787bf0ca63", "translation" => "سواء كنتم مع العائلة، الأصدقاء، أو كنتم تتطلعون فقط للاستمتاع بيوم مريح على الشاطئ، فإن شاطئ الصغيرات هو خيار مثالي. تعالوا واستمتعوا بمياهه الصافية والأجواء الودية في واحد من أفضل شواطئ المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1220
            ["id" => "cf152d11-4a32-474c-84e4-79aafadf7af6", "translation" => "The fig tree beach is a beautiful stretch of sand that provides visitors with a picturesque setting and clear waters, making it a popular destination for locals and tourists alike.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b44d3d3c-4bd5-43f1-bc97-d6aec6459d5c", "translation" => "La plage du Figuier est une magnifique étendue de sable qui offre aux visiteurs un cadre pittoresque et des eaux claires, ce qui en fait une destination populaire pour les habitants et les touristes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2cc16765-7061-411e-8d7f-41767b9f524a", "translation" => "شاطئ الكرمة هو مساحة رملية رائعة توفر للزوار إعدادًا جميلًا ومياهًا صافية، مما يجعله وجهة شهيرة بين السكان المحليين والسياح على حد سواء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1221
            ["id" => "1e790a1b-76ed-46ff-a19b-dac30b4080bf", "translation" => "For photography enthusiasts, the Rotten rock beach is an ideal place to capture impressive images of the rock and the surrounding beauty. It's also a popular spot for picnics and relaxing moments with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2f79abb2-f0e9-4bb4-bdcd-8c0209c7b072", "translation" => "Pour les amateurs de photographie, la plage du Rocher Pourri est un endroit idéal pour capturer des images impressionnantes du rocher et de la beauté environnante. C'est également un lieu populaire pour les pique-niques et les moments de détente en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "48add902-cb0e-4103-9259-407380980636", "translation" => "بالنسبة لهواة التصوير، شاطئ الصخرة المفتتة هو مكان مثالي لالتقاط صور مذهلة للصخرة وجمال المحيط المحيط بها. إنه أيضًا مكان شهير للنزهات واللحظات الاسترخاء مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1222
            ["id" => "1c215487-fdb4-414b-9eb2-a2cb051bc2ff", "translation" => "The Sabliere beach is a popular destination known for its stretches of fine sand, clear waters, and lively atmosphere. It makes for an ideal destination for beach activities and relaxing moments by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d388285b-320c-42ee-8f99-2d1432aa8a18", "translation" => "La plage Sablière est un endroit prisé pour ses étendues de sable fin, ses eaux claires et son ambiance animée. Elle constitue une destination idéale pour les activités balnéaires et les moments de détente en bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "68627585-b7e1-4eac-bd25-8916fc490d42", "translation" => "شاطئ الصابليار وجهة محبوبة معروفة بشواطئها الرملية الناعمة ومياهها الصافية وأجوائها الحية. إنها وجهة مثالية لأنشطة الشاطئ وللأوقات الاسترخائية على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1223
            ["id" => "1fe7d6b5-e03d-419a-b21c-d5ace564d709", "translation" => "The 2nd beach is a small, picturesque beach that offers an intimate and peaceful seaside experience. It's an ideal place for those seeking tranquility and natural beauty while enjoying the simple pleasures of the beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6ffe4fe3-0068-4ea3-ac54-bb4d2385eb85", "translation" => "La 2ème plage est une petite plage pittoresque qui offre une expérience intime et paisible au bord de la mer. C'est un lieu idéal pour ceux qui recherchent la tranquillité et la beauté naturelle tout en profitant des plaisirs simples de la plage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1af14572-d758-40dc-aff0-5f532bafcc61", "translation" => "الشاطئ الثاني هو شاطئ صغير وجميل يقدم تجربة ساحرة وسلمية على شاطئ البحر. إنه مكان مثالي لأولئك الذين يبحثون عن الهدوء والجمال الطبيعي مع الاستمتاع ببساطة متع الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1224
            ["id" => "e2f93755-b6ef-4d6c-85d5-c5f4c449856a", "translation" => "The 1st beach is easily accessible from the city of Boumerdes and attracts a large number of visitors, especially during the summer months. It offers ample space for sunbathing, strolling along the shore, or engaging in water activities such as swimming and beach volleyball.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dc967d6a-1aa0-448c-93e2-16eb54b7112c", "translation" => "La 1ère plage est facilement accessible depuis la ville de Boumerdès et attire un grand nombre de visiteurs, en particulier pendant les mois d'été. Elle offre un vaste espace pour se prélasser au soleil, se promener le long du rivage ou participer à des activités nautiques telles que la baignade et le beach volley.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3223e231-c869-4ca5-8b15-9d730fb89397", "translation" => "الشاطئ الأول يمكن الوصول إليه بسهولة من مدينة بومرداس ويجذب عددًا كبيرًا من الزوار، خاصة خلال أشهر الصيف. يوفر مساحة واسعة للتشمس، والتجول على طول الشاطئ، أو المشاركة في أنشطة مائية مثل السباحة ولعبة الكرة الطائرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1225
            ["id" => "7f96f335-d339-4cad-bc82-2e317d5af90b", "translation" => "The waters along the 800 beach are generally calm and clear, making it a pleasant place to cool off on a hot summer day. Visitors can also enjoy panoramic views of the sea and the stunning sunsets that light up the sky in the evening.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c5832ad8-5abe-4516-92c8-c797ecac8d9f", "translation" => "Les eaux qui bordent la plage des 800 sont généralement calmes et claires, ce qui en fait un endroit agréable pour se rafraîchir par une chaude journée estivale. Les visiteurs peuvent également profiter des vues panoramiques sur la mer et des magnifiques couchers de soleil qui embrasent le ciel en fin de journée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9ba08890-7d27-4b75-b7c2-87bc559f5c15", "translation" => "المياه الواقعة على الساحل الشرقي للشاطئ 800 عادة هادئة وصافية، مما يجعلها مكانًا لطيفًا للتبريد في أيام الصيف الحارة. يمكن للزوار أيضًا الاستمتاع بإطلالات بانورامية على البحر وغروب الشمس الرائع الذي يزين السماء في ساعات المساء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1226
            ["id" => "8daf9188-3e6c-404e-b881-d02900c6a31e", "translation" => "The Boumerdes house of culture is a lively and dynamic place that plays a crucial role in promoting art and culture in the region. It offers a variety of cultural events and activities, allowing residents and visitors to discover and appreciate artistic and intellectual diversity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1200a1e5-8693-4365-8d72-806bc1ce2a80", "translation" => "La maison de la culture de Boumerdès est un lieu animé et dynamique qui joue un rôle essentiel dans la promotion de l'art et de la culture dans la région. Elle offre une variété d'événements et d'activités culturelles, permettant aux habitants et aux visiteurs de découvrir et d'apprécier la diversité artistique et intellectuelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e6a3ba42-7099-45fa-8798-76cd7229fa28", "translation" => "دار الثقافة في بومرداس مكان حيوي ودينامي يلعب دورًا أساسيًا في تعزيز الفن والثقافة في المنطقة. إنه يقدم مجموعة متنوعة من الفعاليات والأنشطة الثقافية، مما يتيح للسكان المحليين والزوار اكتشاف وتقدير التنوع الفني والفكري.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1227
            ["id" => "7bdefb96-5a54-4eba-ab20-24455970c3ef", "translation" => "The Boulevard garden is a welcoming and well-maintained place that provides a soothing and revitalizing environment. Whether it's for a leisurely stroll, an outdoor lunch break, or just to enjoy nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d3a680cd-1dbb-4207-8e5f-445c23e249a7", "translation" => "Le jardin du boulevard est un endroit accueillant et bien entretenu qui offre un cadre apaisant et revitalisant. Que ce soit pour une promenade tranquille, une pause déjeuner en plein air ou simplement pour profiter de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "60c876f2-feff-4127-890e-e8a2e8008dc7", "translation" => "حديقة البولفار هي مكان ترحيبي ومحافظ عليه بعناية يقدم بيئة مهدئة ومنعشة. سواء كان الأمر يتعلق بالمشي برفق أو استراحة غداء في الهواء الطلق أو ببساطة للاستمتاع بالطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1228
            ["id" => "d1b04b00-e6ef-481b-a56b-db29e2e1492f", "translation" => "This garden is carefully landscaped, featuring a variety of plants, trees, and flowers that create a pleasant and relaxing atmosphere. The winding paths invite visitors to enjoy the natural beauty that surrounds them.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e01b3c97-2e4d-48d0-a4c4-1e9c0745a6c5", "translation" => "Ce jardin est aménagé avec soin, offrant une variété de plantes, d'arbres et de fleurs qui créent une ambiance agréable et relaxante. Les sentiers sinueux invitent les visiteurs à profiter de la beauté naturelle qui les entoure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2f42d367-6b58-4d15-ab12-c57de46a5be8", "translation" => "هذه الحديقة مجهزة بعناية، حيث تتضمن مجموعة متنوعة من النباتات والأشجار والزهور التي تخلق أجواء مريحة. الطرق المتعرجة تدعو الزوار للاستمتاع بالجمال الطبيعي الذي يحيط بهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1229
            ["id" => "036f5215-75ad-418f-8445-e55dbada6479", "translation" => "The Dolphin park is a place where visitors can enjoy nature, relax, share a meal, and allow children to have fun safely.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "75ff3d2f-f03a-4cbd-aa02-fa2b9d07fb22", "translation" => "Le parc du Dauphin est un lieu où les visiteurs peuvent profiter de la nature, se détendre, partager un repas et permettre aux enfants de s'amuser en toute sécurité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "502e67b5-941b-4513-bf88-e4aa44302cbe", "translation" => "حديقة الدلفين هي مكان يمكن للزوار الاستمتاع بالطبيعة، والاسترخاء، ومشاركة وجبة طعام، والسماح للأطفال بالاستمتاع بوقت ممتع بأمان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1230
            ["id" => "fb0f8fa3-06b2-4316-a70e-5df0a55b088c", "translation" => "The El Nasr garden is a haven of peace in the midst of the city, providing a well-maintained green space where visitors can relax, stroll, and enjoy the beauty of nature. It's a popular meeting and leisure spot for the locals, offering a pleasant escape from the bustling urban life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f499583d-c02f-4d35-839c-e6d9508c49ec", "translation" => "Le jardin el Nasr est un havre de paix au milieu de la ville, offrant un espace vert bien entretenu où les visiteurs peuvent se détendre, se promener et profiter de la beauté de la nature. C'est un lieu de rencontre et de loisirs apprécié par les habitants, offrant une échappatoire agréable à la vie urbaine animée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e29042a6-0a2e-4354-a6fd-6a460f8bf140", "translation" => "حديقة النصر هي ملاذ للسلام في وسط المدينة، حيث توفر مساحة خضراء محافظة بعناية يمكن للزوار الاسترخاء والتجول فيها والاستمتاع بجمال الطبيعة. إنها مكان للاجتماع والترفيه محبب للسكان المحليين، حيث توفر فرصة للاستراحة اللطيفة من حياة المدينة الحضرية المزدحمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1231
            ["id" => "009bbe84-2c4c-4759-bfdc-36e12d023ae5", "translation" => "The garden has benches scattered throughout the space, providing visitors with places to rest, read a book, or simply enjoy the tranquility. The shade of the trees adds to the garden's coolness, offering a pleasant escape during hot summer days.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5eca9d51-53b1-40e8-85dc-b8ef224c4ae8", "translation" => "Le jardin dispose de bancs disséminés dans tout l'espace, offrant aux visiteurs des endroits pour se reposer, lire un livre ou simplement profiter du calme. L'ombrage des arbres ajoute à la fraîcheur du jardin, offrant une échappatoire agréable pendant les chaudes journées d'été.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "92d32c98-be0c-455e-afac-b5f778bea538", "translation" => "الحديقة مجهزة بمقاعد متناثرة في جميع أنحائها، مما يوفر للزوار أماكن للاستراحة، وقراءة كتاب، أو ببساطة الاستمتاع بالهدوء. ظل الأشجار يزيد من برودة الحديقة، مما يوفر منفذًا لطيفًا خلال أيام الصيف الحارة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1232
            ["id" => "9d264242-665b-4351-902d-626859dcca29", "translation" => "In addition to its tranquility, the December 11th garden also offers a small area for playing the bowls, adding a touch of entertainment to the garden.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c4d909d5-3f2f-413e-8de7-a7e2be1d53f1", "translation" => "En plus de sa tranquillité, le jardin du 11 décembre propose également un petit terrain pour jouer à la pétanque, ajoutant une touche de divertissement au jardin.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "37bc51ef-2017-47c4-8285-3872c8457c8b", "translation" => "بالإضافة إلى هدوئها، توفر حديقة 11 ديسمبر أيضًا منطقة صغيرة للعب الكرة الحديدية، مما يضيف لمسة من التسلية إلى الحديقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1233
            ["id" => "a4d7b501-3385-48e7-8288-957567f08026", "translation" => "The Corso beach is the perfect place to escape the stress of everyday life and rejuvenate in an enchanting natural setting. Whether you're with family or friends, you'll find here a perfect place to create unforgettable memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d79bb45a-568f-4221-aa87-72a7e517e650", "translation" => "La plage de Corso est le lieu idéal pour échapper au stress de la vie quotidienne et se ressourcer dans un cadre naturel enchanteur. Que vous soyez en famille ou entre amis, vous trouverez ici un endroit parfait pour créer des souvenirs inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0b965743-fe2c-4840-be93-ff47c6286bb2", "translation" => "شاطئ قورصو هو المكان المثالي للهروب من ضغوط الحياة اليومية والاستفادة من جمال الطبيعة الساحرة. سواء كنتم مع العائلة أو الأصدقاء، ستجدون هنا مكانًا مثاليًا لخلق ذكريات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1234
            ["id" => "fe40925c-62c8-4f89-a9c0-d79785efd92c", "translation" => "Whether you're looking for a moment of relaxation in the midst of nature, a day of family leisure, or an outdoor adventure, the Corso recreational forest is a must-visit destination. It provides a perfect balance between relaxation, entertainment, and a connection with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "471a11bd-0d17-4c93-a126-b29ab6a9b781", "translation" => "Que vous recherchiez un moment de détente au milieu de la nature, une journée de loisirs en famille ou une aventure en plein air, la forêt récréative de Corso est un lieu à ne pas manquer. Elle offre un équilibre parfait entre détente, divertissement et contact avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7e1bff67-2fb1-4b62-a58e-b3e58f42a730", "translation" => "سواء كنت تبحث عن لحظة استرخاء في قلب الطبيعة، أو يوم من الترفيه مع العائلة، أو مغامرة في الهواء الطلق، فإن غابة الاستجمام قورصو هي وجهة لا يجب تفويتها. إنها توفر توازنًا مثاليًا بين الاسترخاء والترفيه والتواصل مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1235
            ["id" => "c68d075e-de0b-4f92-a922-81021e05272c", "translation" => "This small amusement park provides children with a safe and fun space where they can entertain themselves and play. With its numerous attractions tailored to different ages, this park is an ideal place for families seeking an entertainment experience for their children.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5d68888b-1b9a-4855-8a7d-0f456bbbcb2c", "translation" => "Ce petit parc d'attractions offre aux enfants un espace sûr et amusant où ils peuvent se divertir et jouer. Avec ses nombreuses attractions adaptées à différents âges, ce parc est un lieu idéal pour les familles à la recherche d'une expérience de divertissement pour leurs enfants.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2f63e226-e82f-4a72-bdae-e6ee44416c0e", "translation" => "هذه الحديقة الترفيهية الصغيرة توفر للأطفال مساحة آمنة وممتعة حيث يمكنهم التسلية واللعب. بفضل العديد من الألعاب المناسبة لمختلف الأعمار، تعتبر هذه الحديقة مكانًا مثاليًا للعائلات الباحثة عن تجربة ترفيهية لأطفالها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1236
            ["id" => "eca2e78b-b820-4f42-b477-1afc153fb6b9", "translation" => "The Guedouari beach is a must-visit destination for sea and sun enthusiasts. With its fine sand, crystal-clear waters, and pristine natural surroundings, this beach offers an exceptional seaside experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6ce7bea2-0e8d-4c02-b60a-f0818a4fff1f", "translation" => "La plage Guedouari est une destination incontournable pour les amoureux de la mer et du soleil. Avec son sable fin, ses eaux cristallines et son cadre naturel préservé, cette plage offre une expérience balnéaire exceptionnelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1f4a7fa8-7ec0-47b2-9367-c2aa3f9f4622", "translation" => "شاطئ قدواري وجهة لا غنى عنها لعشاق البحر والشمس. بفضل رماله الناعمة ومياهه الصافية الكريستالية والبيئة الطبيعية الخلابة المحافظة عليها، يقدم هذا الشاطئ تجربة ساحلية استثنائية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1237
            ["id" => "e6d04a5e-e440-447c-b7a3-e95eefd9741d", "translation" => "Whether you're looking for a relaxing day with family or simply a peaceful moment alone, the Alma Marine beach provides an enchanting setting for you to escape and enjoy the simple pleasures of the beach and the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1c5838cb-8f3d-40df-8008-0bf408f5c58b", "translation" => "Que vous recherchiez une journée de détente en famille ou simplement un moment de tranquillité en solitaire, la plage d'Alma Marine vous offre un cadre enchanteur pour vous évader et profiter des plaisirs simples de la plage et de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0ea9791e-c2dd-4576-9aaf-8f4e547015d7", "translation" => "سواء كنت تبحث عن يوم استرخاء مع العائلة أو مجرد لحظة هادئة بمفردك، يقدم شاطئ بودواو البحري محيطًا ساحرًا للهروب والاستمتاع بمتع الشاطئ والبحر البسيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1238
            ["id" => "c79bb157-4250-40f8-b4e6-460973185dfe", "translation" => "With a swimming pool, slides, and swings, the Tamaghra Park provides all the necessary amenities for enjoyable family moments. Families can make use of these facilities and cool off while having fun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b54da1a6-9c52-4394-b1c0-62c92cb292fd", "translation" => "Avec une piscine, des toboggans et des balançoires, Tamaghra Park offre toutes les commodités nécessaires pour passer d'agréables moments en famille. Les familles peuvent profiter de ces installations et se rafraîchir tout en s'amusant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8b22a968-97df-4d17-adba-c9416a29ba78", "translation" => "مع مسبح ومنزلقات وأرجوحات، توفر حديقة تامغرة جميع وسائل الراحة اللازمة لقضاء أوقات ممتعة مع العائلة. يمكن للعائلات الاستفادة من هذه المرافق والاستمتاع بالانتعاش أثناء التسلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1239
            ["id" => "fb6daf2a-7acd-4ad6-aedc-537eae6a40ba", "translation" => "The Kateb Yacine theater is a dynamic cultural venue that celebrates the performing arts and pays tribute to the artistic richness of the region. It's a space where artists can express themselves, where the audience can enjoy quality performances, and where culture and ideas are valued.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8ce44f94-a8bd-45cb-a2f2-ed91b0f72ade", "translation" => "Le théâtre Kateb Yacine est un lieu culturel dynamique qui célèbre les arts de la scène et rend hommage à la richesse artistique de la région. C'est un espace où les artistes peuvent s'exprimer, où le public peut profiter de représentations de qualité et où la culture et les idées sont valorisées.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3e101ec6-dba3-4ab7-9398-e441640630b1", "translation" => "مسرح كاتب ياسين هو مكان ثقافي دينامي يحتفي بفنون المسرح ويكرم الثراء الفني للمنطقة. إنه مساحة يمكن للفنانين فيها التعبير عن أنفسهم، وحيث يمكن للجمهور الاستمتاع بعروض عالية الجودة، وحيث يتم تقدير الثقافة والأفكار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1240
            ["id" => "8bba86e5-af50-446e-9c7c-d43eef65c653", "translation" => "The Chachnak statue is an impressive artistic representation that pays tribute to an important historical figure of the region. It symbolizes strength, courage, and cultural heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b996cc95-1d89-4bae-aa4f-a16ec29625f7", "translation" => "La statue de Chachnak est une représentation artistique impressionnante qui rend hommage à une figure historique importante de la région. Elle symbolise la force, le courage et l'héritage culturel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7cd03513-6dc4-4763-9631-cf3674e4bb71", "translation" => "تمثال شاشناق هو تمثيل فني رائع يكرم شخصية تاريخية مهمة في المنطقة. إنه يرمز إلى القوة والشجاعة والتراث الثقافي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1241
            ["id" => "aa3f485a-edcd-4b19-aef3-10a0f0e86d4d", "translation" => "The Colonel Mohand Oulhadj garden is a pleasant place where visitors can relax, stroll, and reconnect with nature. Whether for a quiet getaway or to participate in community events, this garden provides a haven of peace in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "86181938-0551-497e-9ea0-1bb7e2531afc", "translation" => "Le jardin du Colonel Mohand Oulhadj est un endroit agréable où les visiteurs peuvent se détendre, se promener et se reconnecter avec la nature. Que ce soit pour une escapade tranquille ou pour participer à des événements communautaires, ce jardin offre un havre de paix au cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "923101d7-71a0-4b76-b647-084b8dd386a0", "translation" => "حديقة العقيد محند اولحاج هي مكان لطيف حيث يمكن للزوار الاسترخاء والتجول وإعادة الاتصال مع الطبيعة. سواء كان الأمر يتعلق بالابتعاد الهادئ أو المشاركة في الفعاليات المجتمعية، توفر هذه الحديقة ملاذًا للسلام في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1242
            ["id" => "6597910a-bb79-4a9c-b68a-b9f5a88af30b", "translation" => "Whether you're in search of tranquility, cultural discoveries, or sports experiences, the Beni Amrane dam is the perfect place to satisfy all your desires.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "79d2d746-d95b-4416-b9d3-dca0ac50de9a", "translation" => "Que vous soyez en quête de tranquillité, de découvertes culturelles ou d'expériences sportives, le barrage de Béni Amrane est l'endroit idéal pour satisfaire toutes vos envies.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ea6e4c1c-5544-4e4f-aa5c-b9fb449389d2", "translation" => "سواء كنت بحثاً عن السكينة أو الاكتشافات الثقافية أو تجارب رياضية، فسد بني عمران هو المكان المثالي لتلبية جميع رغباتك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1243
            ["id" => "b5dc1959-7aa4-4446-b200-44fce24840b8", "translation" => "Whether it's for a family outing, a birthday celebration, or just to have a fun day, the Ben Adjal amusement park is the perfect place to create unforgettable memories for children.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "05f469c8-29f2-4a0f-881e-0cb4ae5ff89a", "translation" => "Que ce soit pour une sortie en famille, un anniversaire ou simplement pour passer une journée de plaisir, le parc de divertissement Ben Adjal est l'endroit idéal pour offrir aux enfants des souvenirs inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dfc52258-89a5-40c5-a898-3c88091e66a4", "translation" => "سواء كان الأمر يتعلق برحلة عائلية أو احتفال بعيد ميلاد أو مجرد قضاء يوم ممتع، تعتبر حديقة بن عجال الترفيهية المكان المثالي لإنشاء ذكريات لا تُنسى للأطفال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1244
            ["id" => "dcd2b5a8-d9fb-4fa8-a57d-8ab3c30c29d0", "translation" => "This enchanting garden provides residents and visitors with a green space to relax, stroll, and enjoy nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "76ea7841-c9f9-4114-860d-346f920fa5b2", "translation" => "Ce jardin enchanteur offre aux habitants et aux visiteurs un espace verdoyant où se détendre, se promener et profiter de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8a86412f-9dfc-4255-8249-22a29217a3ac", "translation" => "هذه الحديقة الساحرة توفر للسكان والزوار مساحة خضراء للاسترخاء والتجول والاستمتاع بالطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1245
            ["id" => "ffb7b2d8-3ca1-49c9-943c-bd2ba2cf1afe", "translation" => "Come and discover the Keddara dam and be amazed by its grandeur and natural beauty. Admire its impressive dimensions and enjoy a moment of connection with nature in a unique setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "521f961b-56df-4950-9180-b109c52de892", "translation" => "Venez découvrir le barrage de Keddara et laissez-vous émerveiller par sa grandeur et sa beauté naturelle. Admirez ses dimensions impressionnantes et profitez d'un moment de connexion avec la nature dans un cadre unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "270c1105-e636-43fa-a355-d6cdd03ae2c2", "translation" => "تعالوا واكتشفوا سد قدارة واستمتعوا أمام عظمته وجماله الطبيعي. تأملوا في أبعاده الرائعة واستمتعوا بلحظة اتصال مع الطبيعة في إطار فريد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1246
            ["id" => "a26525bc-46ec-4997-aa6f-e39cf17a596c", "translation" => "Whether you're a performing arts enthusiast, a passionate music lover, or simply seeking an enriching cultural experience, the regional theater of Issers welcomes you.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "97a7c16b-9e2f-445f-ab53-821b7af6944a", "translation" => "Que vous soyez un amateur d'arts vivants, un mélomane passionné ou simplement à la recherche d'une expérience culturelle enrichissante, le théâtre régional des Issers vous ouvre ses portes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b7b19bd4-cc0c-4b18-8bf7-ca1c7e87cb45", "translation" => "سواء كنت عاشقًا للفنون المسرحية، أو محبًا متحمسًا للموسيقى، أو مجردًا بحثًا عن تجربة ثقافية غنية، يفتح لك مسرح يسر الجهوي أبوابه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1247
            ["id" => "b70f856a-1509-4573-af5c-37c6f418af82", "translation" => "The Lyna Park is a must-visit destination for a day of unparalleled adventure and entertainment. This park offers a comprehensive experience for all visitors, from thrill-seekers to families looking for moments of relaxation and fun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "34dadb88-4162-4750-9f16-36d44671380f", "translation" => "Lyna Park est un lieu incontournable pour une journée d'aventures et de divertissement sans pareil. Ce parc offre une expérience complète pour tous les visiteurs, des amateurs de sensations fortes aux familles à la recherche de moments de détente et de plaisir.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "adb8ce3d-1ead-4fcf-92c0-e97fa3bedb4a", "translation" => "حديقة لينة بارك وجهة لا بد منها لقضاء يوم مليء بالمغامرات والترفيه الفريد من نوعه. يقدم هذا المنتزه تجربة شاملة لجميع الزوار، بدءًا من عشاق المغامرات إلى العائلات الباحثة عن لحظات الاسترخاء والمرح.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1248
            ["id" => "84c35341-5d01-4c32-8c27-ceb190cc9a43", "translation" => "The Reghaia beach is an exceptional coastal destination that invites visitors to enjoy moments of relaxation and fun by the sea. With its natural charm and clear waters, this beach is the perfect place to escape the everyday and enjoy memorable beach vacations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c88b3f70-9e2a-421c-abd2-d6b198a3f195", "translation" => "La plage de Reghaia est une destination côtière exceptionnelle qui invite les visiteurs à vivre des moments de détente et de plaisir au bord de la mer. Avec son charme naturel et ses eaux claires, cette plage est l'endroit idéal pour échapper au quotidien et profiter de vacances balnéaires mémorables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7f2d6e76-98e7-402e-96bd-ad9f9001f047", "translation" => "شاطئ الرغاية هو وجهة ساحلية استثنائية تدعو الزوار لقضاء لحظات من الاسترخاء والمرح على شاطئ البحر. بفضل سحرها الطبيعي ومياهها الصافية، يعتبر هذا الشاطئ المكان المثالي للهروب من الحياة اليومية والاستمتاع بعطلة ساحلية لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1249
            ["id" => "ff79c373-f826-45d1-9987-4c4fd9739481", "translation" => "The liberty garden is a welcoming space where residents and visitors can enjoy nature, relax, and spend quality time outdoors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "389c3ea4-b08d-4c3f-90f5-2a64f794f151", "translation" => "Le jardin de la Liberté est un espace accueillant où les habitants et les visiteurs peuvent profiter de la nature, se détendre et passer du temps de qualité en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5890829d-fc8e-4702-9255-ea54546a7d71", "translation" => "حديقة الحرية مساحة ترحيبية حيث يمكن للسكان والزوار الاستمتاع بالطبيعة والاسترخاء وقضاء وقت ذو جودة عالية في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1250
            ["id" => "48846e7a-aa92-43e7-9ee4-bc8fb6b6e7e4", "translation" => "This public garden is well-maintained and features careful landscaping. The pathways are clean and well-kept, providing a pleasant environment for strolling.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dd6503d3-e492-4e0a-8bc5-3276ddecd5c6", "translation" => "Ce jardin public est bien entretenu et bénéficie d'un aménagement paysager soigné. Les allées sont propres et bien entretenues, offrant ainsi un environnement agréable pour se promener.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "be9776bc-3989-4389-8573-fc89d88e74cb", "translation" => "هذه الحديقة العامة مُعتنى بها بشكل جيد وتحتوي على تصميم مناظر طبيعية دقيق. الممرات نظيفة ومُعتنى بها جيدًا، مما يوفر بيئة ممتعة للتجول.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1251
            ["id" => "ffbb9922-6424-4a2b-9cd7-46e7876b76dc", "translation" => "Surrounded by buildings and businesses, the Reghaia square provides a lively urban setting with a friendly atmosphere. Residents and visitors can enjoy this space to relax, socialize, or simply observe the daily hustle and bustle of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fa615a97-cc79-4463-9857-a45bec1f4b96", "translation" => "Entourée de bâtiments et de commerces, la place de Reghaïa offre un cadre urbain animé, avec une atmosphère conviviale. Les habitants et les visiteurs peuvent profiter de cet espace pour se détendre, socialiser ou simplement observer l'activité quotidienne de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "985cde6a-939e-4257-a5ca-c81012902d4c", "translation" => "محاطة بالمباني والمحلات التجارية، توفر ساحة الرغاية إعدادًا حضريًا حيويًا مع أجواء ودية. يمكن للسكان والزوار الاستفادة من هذا المكان للاسترخاء والتواصل الاجتماعي، أو ببساطة لمراقبة الحياة اليومية المزدحمة في المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1252
            ["id" => "589bdcb3-6445-4a2a-a468-9fcf5bfeff39", "translation" => "The El Kadous beach is a place where you can escape the stress of daily life and immerse yourself in a calm and enchanting environment. Whether you're looking for a relaxing day with family or an outdoor adventure, this beach has everything you need.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4c36ded7-0054-4119-96cd-acddf5811771", "translation" => "La plage el Kadous est un endroit où vous pourrez vous échapper du stress de la vie quotidienne et vous immerger dans un environnement calme et enchanteur. Que vous soyez à la recherche d'une journée de détente en famille ou d'une aventure en plein air, cette plage vous offre tout ce dont vous avez besoin.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f50866f8-c57a-4746-9121-e8f355dd5b47", "translation" => "شاطئ القادوس مكان يمكنك فيه الهروب من ضغوط الحياة اليومية والانغماس في بيئة هادئة وساحرة. سواء كنت تبحث عن يوم من الاسترخاء مع العائلة أو مغامرة في الهواء الطلق، يقدم لك هذا الشاطئ كل ما تحتاجه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1253
            ["id" => "e602547f-69d6-423a-a257-7070d75dbbc5", "translation" => "It's a place where swimming is allowed, and visitors can enjoy its clear and refreshing waters. The fine sand is characteristic of this beach, providing a comfortable surface for relaxation and sunbathing.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8bac7dc5-776a-4e4b-936b-f45c86a0ed51", "translation" => "C'est un lieu où la baignade est autorisée et où les visiteurs peuvent profiter de ses eaux claires et rafraîchissantes. Le sable fin est caractéristique de cette plage, offrant un confort agréable pour se détendre et s'allonger au soleil.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cf1c757e-a4fb-4f26-837e-f1a051617e34", "translation" => "إنه مكان حيث السباحة مسموحة وأين يمكن للزوار الاستمتاع بمياهه الصافية والمنعشة. الرمال الناعمة هي سمة مميزة لهذا الشاطئ، مما يوفر سطحًا مريحًا للاسترخاء والاستلقاء تحت أشعة الشمس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1254
            ["id" => "cde5662d-ebab-4980-ac9e-86ac639d5ed5", "translation" => "Deca plage is a stunning coastal site with golden sands and a beautiful expanse, making it a popular destination for many visitors and providing a lively atmosphere. Come and enjoy the beauty of Deca plage on your next getaway to the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3dfe641b-c2be-4f6f-91f8-187b62ac31e4", "translation" => "Deca plage est un superbe site balnéaire avec un sable doré et une belle étendue, qui en fait un lieu apprécié par de nombreux visiteurs et offre une atmosphère animée. Venez profiter de la beauté de Deca plage lors de votre prochaine escapade dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "71c1c391-4467-4a51-bf5d-aa0d032970d8", "translation" => "شاطئ ديكا بلاج هو موقع ساحلي رائع برماله الذهبية ومساحته الجميلة، مما يجعله وجهة محبوبة للعديد من الزوار ويوفر أجواء حيوية. تعال واستمتع بجمال شاطئ ديكا بلاج في رحلتك القادمة إلى المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1255
            ["id" => "a03ed8c3-f1c8-44d9-a862-04831d596b26", "translation" => "Whether you're looking for relaxation, refreshing swims, or water activities, the Surcouf beach is an ideal place to spend enjoyable moments with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cdd3e68b-13cb-4d9c-85be-f6555742163b", "translation" => "Que vous soyez en quête de détente, de baignade rafraîchissante ou d'activités nautiques, la plage Surcouf est un lieu idéal pour passer des moments agréables en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "20ebb749-d432-4026-8ad7-f4cdb3e092be", "translation" => "سواء كنت تبحث عن الاسترخاء أو السباحة المنعشة أو الأنشطة المائية، شاطئ سركوف مكان مثالي لقضاء لحظات ممتعة مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1256
            ["id" => "e6c0dd97-f847-4a14-b9ac-cf04d83bd066", "translation" => "Whether you're looking for relaxation, refreshing swims, or water activities, the Tamaris beach is an ideal place to spend enjoyable moments with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4e732de1-87c8-489e-aa82-4ec11506492a", "translation" => "Que vous soyez en quête de détente, de baignade rafraîchissante ou d'activités nautiques, la plage Tamaris est un lieu idéal pour passer des moments agréables en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2b020c5e-ee0f-4999-b1e9-9ba168e1e9ed", "translation" => "سواء كنت تبحث عن الاسترخاء، أو السباحة المنعشة، أو الأنشطة المائية، شاطئ تماريس هو مكان مثالي لقضاء أوقات ممتعة مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1257
            ["id" => "6b250de8-ae3b-4f3c-b7cd-cd1145a64f68", "translation" => "Whether it's for reading a book, meditating, or simply contemplating the beauty of nature, this garden provides an ideal refuge away from the hustle and bustle of everyday life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5ff3ae16-2644-40e1-a8fd-8ac3343807f4", "translation" => "Que ce soit pour lire un livre, méditer ou simplement contempler la beauté de la nature, ce jardin offre un refuge idéal loin du tumulte de la vie quotidienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "db35521f-7003-4648-8531-8234f0f2b24c", "translation" => "سواءً كان الأمر لقراءة كتاب أو ببساطة التأمل في جمال الطبيعة، هذه الحديقة توفر ملاذًا مثاليًا بعيدًا عن صخب الحياة اليومية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1258
            ["id" => "7221fcf5-eeb8-49ee-917e-8a1fc626ae0d", "translation" => "Whether you're passionate about sailing, curious to explore port activities, or simply seeking a pleasant seaside stroll, the port of Jean Bart is a captivating place to visit.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d6a357eb-fd44-40e3-8d41-e54c623f7eb2", "translation" => "Que vous soyez passionné de navigation, curieux de découvrir l'activité portuaire ou simplement en quête d'une promenade agréable au bord de la mer, le port de Jean Bart est un endroit captivant à visiter.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "54828795-eae8-46ad-8c87-04fe1f3bcffb", "translation" => "سواء كنت متحمسًا لرياضة الإبحار، أو فضوليًا لاستكشاف الأنشطة المينائية، أو مجرد بحثك عن نزهة لطيفة على شاطئ البحر، ميناء جون بارت هو مكان مثير لزيارته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1259
            ["id" => "f6a3088e-6f39-4033-b109-a4fae9581c1d", "translation" => "Whether you're an avid sailor or simply looking for a pleasant place for a seaside stroll, the Tamentfoust marina offers a memorable maritime experience. Come and enjoy the pleasant atmosphere of this port, discover the various moored boats, and soak in the maritime ambiance of this charming destination.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "351a49d5-4907-4476-8ae2-b226040a234c", "translation" => "Que vous soyez un navigateur passionné ou simplement à la recherche d'un endroit agréable pour vous promener au bord de la mer, le port de plaisance de Tamentfoust offre une expérience maritime mémorable. Venez profiter de l'atmosphère plaisante de ce port, découvrir les différents bateaux amarrés et vous imprégner de l'ambiance maritime de cette charmante destination.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c0c533e6-7a98-4cd0-9ee0-12e672ab8369", "translation" => "سواء كنت بحّارًا متحمسًا أم مجرد بحثك عن مكان لطيف للتجول على شاطئ البحر، ميناء تامنتفوست يقدم تجربة بحرية لا تُنسى. تعال واستمتع بالجو اللطيف في هذا المرفأ، واكتشف مجموعة متنوعة من القوارب المرسوة، واستمتع بأجواء البحر في هذه الوجهة الساحرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1260
            ["id" => "20947f47-f756-44f3-b42b-31d00f032b50", "translation" => "The beach's proximity to other tourist attractions and recreational facilities makes it a popular destination for visitors from all walks of life. Whether you're looking for relaxation, water adventures, or simply a pleasant seaside getaway, the Tamentfoust East beach is an ideal place to create unforgettable moments with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3e2a95ce-9f54-438d-b44c-080103cc0a50", "translation" => "La proximité de la plage avec d'autres attractions touristiques et équipements de loisirs en fait un lieu apprécié par les visiteurs de tous horizons. Que vous soyez en quête de détente, d'aventure nautique ou simplement d'une escapade agréable en bord de mer, la plage Tamentfoust Est est un lieu idéal pour passer des moments inoubliables en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f48188cc-9071-4c25-9888-42dcaa97ec6b", "translation" => "قرب الشاطئ من معالم سياحية أخرى ومرافق ترفيهية يجعله وجهة محبوبة للزوار من جميع الأوجه. سواء كنت تبحث عن الاسترخاء أو المغامرات المائية أو ببساطة عن رحلة لطيفة على الشاطئ، شاطئ تامنتفوست الشرقي هو المكان المثالي لخلق لحظات لا تُنسى مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1261
            ["id" => "a0b9f188-7abf-453c-bc95-feee761cfd85", "translation" => "The Tamentfoust West beach offers a friendly and relaxed atmosphere. Visitors can enjoy moments of tranquility while admiring the coastal landscapes or immerse themselves in the lively atmosphere by visiting the nearby restaurants and cafes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c89665d0-f967-4653-8257-db25925f0c0f", "translation" => "La plage Tamentfoust Ouest offre une ambiance conviviale et détendue. Les visiteurs peuvent profiter de moments de tranquillité en admirant les paysages côtiers ou se mêler à l'animation en rejoignant les restaurants et les cafés situés à proximité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "be578d08-e04d-4bee-8678-36ca7d1819dd", "translation" => "شاطئ تامنتفوست الغربي يقدم أجواء ودية ومسترخية. يمكن للزوار الاستمتاع بلحظات من الهدوء أثناء مشاهدة المناظر الساحلية أو الانخراط في الأجواء المليئة بالحيوية من خلال زيارة المطاعم والمقاهي الواقعة على مقربة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1262
            ["id" => "ab3dea45-1eb7-497b-8afe-64c78cb32b9d", "translation" => "Despite the challenges related to site preservation, archaeological research has been conducted, uncovering an epigraphic ensemble from the Christian era as well as thermal baths. These discoveries contribute to enriching our understanding of the history of this ancient city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d031e300-7ca1-43c0-b71f-a6fef9faf279", "translation" => "Malgré les défis liés à la préservation du site, des recherches archéologiques ont été menées, mettant en lumière un ensemble épigraphique de l'époque chrétienne ainsi que des thermes. Ces découvertes contribuent à enrichir notre compréhension de l'histoire de cette ancienne cité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "51e65bfa-1f44-4eea-a034-11206e561875", "translation" => "على الرغم من التحديات المتعلقة بحفظ الموقع، تمت أبحاث أثرية، كشفت عن مجموعة نقوش من العصور المسيحية وأيضًا عن حمامات. هذه الاكتشافات تساهم في إثراء فهمنا لتاريخ هذه المدينة القديمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1263
            ["id" => "78f63bfd-e6a1-4a06-b41b-4007f42b3eb5", "translation" => "The Marina Palm is a women's and children's exclusive club that offers a range of facilities and services for the enjoyment of visitors. You'll find a beach, a swimming pool, and wading pools, providing multiple options to cool off and enjoy the water.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d9152be5-cdb9-47ee-8e21-94629016af07", "translation" => "Le Marina Palm est un club exclusivement dédié aux femmes et aux enfants qui propose une gamme d'installations et de services pour le plaisir des visiteurs. vous trouverez une plage, une piscine et des bassins, offrant ainsi plusieurs options pour se rafraîchir et profiter de l'eau.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5a0c2321-f190-4ab6-b263-4b97651a7a01", "translation" => "نخلة مارينا هو نادي مخصص حصراً للنساء والأطفال يقدم مجموعة من المرافق والخدمات للتمتع بالزيارة. ستجدين شاطئًا و مسبح وبرك، مما يوفر خيارات متعددة للتبريد والاستمتاع بالمياه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1264
            ["id" => "575d1a8c-6093-4416-b844-699feaab7f35", "translation" => "The Coco beach invites visitors to relax and soak up the sun. Its clear and refreshing waters are perfect for swimming and aquatic pleasures.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4c6bd3d4-35ce-4a4c-8939-653ba663483a", "translation" => "Coco plage invite les visiteurs à se détendre et à se prélasser au soleil. Ses eaux claires et rafraîchissantes sont parfaites pour la baignade et les plaisirs aquatiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cbbf1477-b2d6-4b1c-a8f7-e2737cff3ef9", "translation" => "شاطئ كوكو بلاج يدعو الزوار إلى الاسترخاء والاستمتاع بأشعة الشمس. مياهه الواضحة والمنعشة مثالية للسباحة والمرح في المياه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1265
            ["id" => "d1e4fb96-83a2-41ed-bd7d-ee162dac77cb", "translation" => "Whether you're looking for a place to relax, water activities, or just a family getaway, the Ondines North beach has it all.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "92892d2d-4c25-4c21-8439-3aa2fc1ccf5c", "translation" => "Que vous soyez à la recherche d'un lieu pour vous détendre, d'activités nautiques ou simplement d'une escapade en famille, la plage des Ondines Nord a tout pour plaire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b01607d3-cd87-42c7-8d6c-f41807edaa1e", "translation" => "سواء كنت تبحث عن مكان للاسترخاء، أو أنشطة مائية، أو مجرد رحلة عائلية، شاطئ الأندين الشمالي يقدم كل ما تحتاجه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1266
            ["id" => "d8ae863e-efe4-4f7e-9886-a69ba8901165", "translation" => "Whether it's for swimming, diving, visiting the nearby Ottoman fort, or simply strolling along the beach, the Broken boat beach offers a unique experience where natural beauty and history intersect. Come explore this captivating place and be enchanted by the magic of this beach, a perfect blend of nature and heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "965e2b46-c9c4-4b00-ac44-442582caa0c0", "translation" => "Que ce soit pour se baigner, faire de la plongée, visiter le fort Ottoman à proximité ou simplement se promener le long de la plage, la plage Bateau Cassé offre une expérience unique où la beauté naturelle et l'histoire se rencontrent. Venez explorer ce lieu captivant et laissez-vous séduire par la magie de cette plage, un mariage parfait entre nature et patrimoine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f89c2bcc-ae18-4e9c-895e-f04a34036f63", "translation" => "سواء كنتم ترغبون في السباحة، أو الغطس، أو زيارة القلعة العثمانية القريبة، أو حتى مجرد التجول على طول الشاطئ، شاطئ القارب المكسور يقدم تجربة فريدة حيث تتلاقى الجمال الطبيعي والتاريخ. تعالوا واكتشفوا هذا المكان الساحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1267
            ["id" => "bcff6a4d-71ae-4ebe-9ed5-9cdb6204b433", "translation" => "This beach provides an idyllic setting of great beauty. With its fine sand, crystal-clear waters, and peaceful atmosphere, the Green shore beach is the perfect place to relax and rejuvenate.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3d72b87c-84b4-4b14-8411-321fac612e34", "translation" => "Cette plage offre un cadre idyllique d'une grande beauté. Avec son sable fin, ses eaux cristallines et son ambiance paisible, la plage de la Verte Rive est l'endroit idéal pour se détendre et se ressourcer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5ad0f72b-f8e3-41ae-8d87-8a0f6609a5aa", "translation" => "هذا الشاطئ يقدم إعدادًا خياليًا من الجمال الكبير. برماله الناعمة ومياهه الصافية الكريستالية و أجوائه الهادئة، شاطئ الضفة الخضراء هو المكان المثالي للاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1268
            ["id" => "53fdeccb-4264-4147-98dd-41909338523d", "translation" => "Whether you want to relax in the sun or engage in sports activities, this beach has everything you need. Fishing enthusiasts will find plenty of opportunities for recreational fishing. Moreover, you'll have access to all the amenities required for a peaceful day.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5ce73193-c432-42b1-a6e1-a95c71a41a24", "translation" => "Que vous souhaitiez vous détendre au soleil ou pratiquer des activités sportives, cette plage offre tout ce dont vous avez besoin. Les amateurs de pêche y trouveront leur bonheur grâce à de nombreuses opportunités de pêche de loisir. De plus, vous aurez accès à toutes les commodités nécessaires pour passer une journée tranquille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "67b8f4b0-2c26-4a21-b25d-d96e06446906", "translation" => "سواء كنت ترغب في الاسترخاء تحت أشعة الشمس أو ممارسة أنشطة رياضية، يوفر هذا الشاطئ كل ما تحتاجه. سيجد عشاق الصيد كثيرًا مما يسرهم من فرص للصيد الترفيهي. بالإضافة إلى ذلك، ستتاح لك جميع وسائل الراحة اللازمة لقضاء يوم هادئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1269
            ["id" => "aaaced63-862f-4402-8ef2-0a0e8525fb81", "translation" => "Whether you want to relax in the sun or engage in sports activities, this beach has everything you need. Fishing enthusiasts will find plenty of opportunities for recreational fishing. Moreover, you'll have access to all the amenities required for a peaceful day.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d5c6f374-a7cf-43e9-92e3-8d8514186a70", "translation" => "Que vous souhaitiez vous détendre au soleil ou pratiquer des activités sportives, cette plage offre tout ce dont vous avez besoin. Les amateurs de pêche y trouveront leur bonheur grâce à de nombreuses opportunités de pêche de loisir. De plus, vous aurez accès à toutes les commodités nécessaires pour passer une journée tranquille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4f7f085d-1a16-4479-8b87-1cbad1af9d97", "translation" => "سواء كنت ترغب في الاسترخاء تحت أشعة الشمس أو ممارسة أنشطة رياضية، يوفر هذا الشاطئ كل ما تحتاجه. سيجد عشاق الصيد كثيرًا مما يسرهم من فرص للصيد الترفيهي. بالإضافة إلى ذلك، ستتاح لك جميع وسائل الراحة اللازمة لقضاء يوم هادئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1270
            ["id" => "3b1f54be-4bb5-4c97-a23c-f5471a82ffc6", "translation" => "This fort bears witness to the imprint left by the Ottoman Empire in the region. With its massive walls and imposing architecture, this structure is an architectural marvel not to be missed.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "006bb5bd-634f-4e37-944b-e82246cf690b", "translation" => "Ce fort témoigne de l'empreinte laissée par l'Empire ottoman dans la région. Avec ses murs massifs et son architecture imposante, cet édifice est une merveille architecturale à ne pas manquer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "555db0ee-47f9-45ec-87e5-4661298629d4", "translation" => "هذه القلعة تشهد على الأثر الذي تركه الإمبراطورية العثمانية في المنطقة. بجدرانها الضخمة وهندستها الرائعة، هذا المبنى هو من العجائب المعمارية التي يجب عدم تفويتها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1271
            ["id" => "8f246713-7e61-411a-9803-b7b6ab279872", "translation" => "This leisure complex offers a multitude of activities for all tastes and ages. Thrill-seekers will be delighted by thrilling water slides, refreshing pools, and interactive water games.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0cb1f4e9-9d16-4523-a46f-f47b2e0b4f90", "translation" => "Ce complexe de loisirs offre une multitude d'activités pour tous les goûts et tous les âges. Les amateurs de sensations fortes seront comblés par les toboggans aquatiques palpitants, les piscines rafraîchissantes et les jeux d'eau interactifs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "124d496a-625b-474e-9488-87b0de745938", "translation" => "يقدم هذا المجمع الترفيهي مجموعة متنوعة من الأنشطة لكافة الأذواق والأعمار. سيجد عشاق التشويق متعة كبيرة في الزلاجات المائية المثيرة، والمسابح المنعشة، وألعاب المياه التفاعلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1272
            ["id" => "d1ea2597-19fb-4036-87f9-20aab45e248a", "translation" => "Aquafortland is the perfect place to have fun, relax, and create unforgettable memories in a friendly and welcoming setting. Come and enjoy all the facilities and exciting activities offered by this exceptional water park.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0c95d823-16b5-478f-ab2c-fa8c23f3dff3", "translation" => "Aquafortland est l'endroit idéal pour se divertir, se relaxer et créer des souvenirs inoubliables dans un cadre convivial et accueillant. Venez profiter de toutes les installations et activités passionnantes offertes par ce parc aquatique exceptionnel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "50b03e7f-b30f-4845-8c0c-0c6dea467f2d", "translation" => "أكوافورتلاند هو المكان المثالي للاستمتاع بالمرح، والاسترخاء، وخلق ذكريات لا تُنسى في أجواء ودية ومرحبة. تعال واستمتع بجميع المرافق والأنشطة المثيرة التي يقدمها هذا المنتزه المائي الاستثنائي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1273
            ["id" => "f8e0d958-8840-458b-9617-e737c71a36f0", "translation" => "The Dino Park is a captivating amusement park that offers a unique experience for visitors of all ages. Explore a variety of thrilling rides, challenging interactive games, and shows that will delight both young and old.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "55665ef0-9a3b-4ecb-9394-4362f1cc13cd", "translation" => "Le Dino Parc est un parc d'attractions captivant qui propose une expérience unique pour les visiteurs de tous âges. Découvrez une variété de manèges passionnants, des jeux interactifs stimulants et des spectacles qui émerveilleront petits et grands.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "14d82079-14f9-4358-aff9-769b81c23d21", "translation" => "دينو بارك هو متنزه ترفيهي مثير يقدم تجربة فريدة للزوار من جميع الأعمار. استكشف مجموعة متنوعة من الألعاب المثيرة والألعاب التفاعلية التحديّة والعروض التي ستبهر الصغار والكبار على حد سواء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1274
            ["id" => "44642c6c-b6ce-4a5a-b1b6-3a2a04e96eb2", "translation" => "The Kiddy Park is an indoor amusement park specially designed for children, offering a world of entertainment and fun, a variety of attractions and activities that guarantee hours of joy and amusement.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1ddcede2-ec50-474e-b447-573cdb2b03ff", "translation" => "Le Kiddy Park est un parc de loisirs en intérieur spécialement conçu pour les enfants, offrant un monde de divertissement et de plaisir, une variété d'attractions et d'activités qui garantissent des heures de joie et d'amusement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4f8898b2-edee-47b1-b247-bad4ef8d7b36", "translation" => "كيدي بارك هو متنزه ترفيهي داخلي مصمم خصيصًا للأطفال، يقدم عالمًا من الترفيه والمرح، مجموعة متنوعة من الألعاب والأنشطة التي تضمن ساعات من الفرح والمرح.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1275
            ["id" => "72e07fd3-53eb-434f-bc92-48eea82d65e1", "translation" => "As soon as you enter, you will be immersed in the atmosphere of a real pirate's lair, with striking decorations and hidden treasures. Children can have fun like real pirates by exploring interactive play structures, climbing ropes, and sliding down slides.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "baebd56c-7d1c-4383-8277-c98706ffa799", "translation" => "Dès votre entrée, vous serez immergé dans l'ambiance d'un véritable repaire de pirates, avec des décors saisissants et des trésors cachés. Les enfants pourront s'amuser comme de véritables pirates en explorant des structures de jeux interactives, en escaladant des cordes et en glissant le long de toboggans.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d5692295-672b-4627-9168-0159051ab3be", "translation" => "فور دخولك، ستغمر نفسك في أجواء وكأنك في مستوطنة حقيقية للقراصنة، مع ديكورات مذهلة وكنوز مخبأة. يمكن للأطفال الاستمتاع كأنهم قراصنة حقيقيين من خلال استكشاف هياكل الألعاب التفاعلية، وتسلق الحبال، والانزلاق على طول الزلاجات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1276
            ["id" => "57e41a70-65c0-44a7-afa6-20c083781a1c", "translation" => "Whether you're a karting enthusiast or looking for an entertaining activity, the Star Race Karting promises you a memorable racing experience and unmatched moments of fun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "28a1ec2b-a526-4d34-8103-e0df55095253", "translation" => "Que vous soyez passionné de karting ou à la recherche d'une activité divertissante, le Star Race Karting vous promet une expérience de course mémorable et des moments de plaisir sans pareil.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8eabd0dd-ed36-412f-b5b9-66c4eb77e3ad", "translation" => "سواء كنت عاشقًا لسباقات الكارتينج أو تبحث عن نشاط مسلٍ، يعد ستار رايس كارتينج بتقديم تجربة سباق لا تُنسى ولحظات ممتعة لا تُضاهى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1277
            ["id" => "95980b33-827b-4cd1-b152-1b5a8ecf33ef", "translation" => "As soon as you arrive, you will be welcomed by a colorful and lively environment, creating a joyful atmosphere. Children can enjoy exciting rides, interactive games, inflatable structures, and much more. They can jump, slide, and have fun safely in this specially designed space for them.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ac23526a-1df7-4dba-8184-b5f1959d91ca", "translation" => "Dès votre arrivée, vous serez accueilli par un environnement coloré et animé, créant une atmosphère joyeuse. Les enfants pourront profiter de manèges excitants, de jeux interactifs, de structures gonflables et bien plus encore. Ils pourront sauter, glisser et s'amuser en toute sécurité dans cet espace spécialement conçu pour eux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f217151e-725a-4339-a6bd-f20bb0d82002", "translation" => "منذ وصولك، ستكون مرحبًا بك في بيئة ملونة ومفعمة بالحيوية، مما يخلق جوًا مبهجًا. يمكن للأطفال الاستمتاع بالركوبات المثيرة والألعاب التفاعلية والهياكل القابلة للنفخ والمزيد. يمكنهم القفز والانزلاق والمرح بأمان في هذا الفضاء المصمم خصيصًا لهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1278
            ["id" => "2e3bf02b-2e71-4add-a417-8ef902207c79", "translation" => "At Dream Park, the attractions are suitable for different ages and comfort levels, providing an enjoyable experience for everyone. Parents can relax in designated resting areas while keeping an eye on their children having fun. In addition to the attractions, the park also offers snack stands where you can grab a bite to eat.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fb51fe6d-fb78-4507-9c98-b68381e9ab03", "translation" => "Au Dream Park, les attractions sont adaptées à différents âges et niveaux de confort, offrant une expérience agréable pour tous. Les parents pourront se détendre dans les espaces de repos prévus à cet effet, tout en gardant un œil sur leurs enfants qui s'amusent. En plus des attractions, le parc propose également des stands de collations où vous pourrez vous restaurer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "21333148-851c-4029-9417-158ed107b1b6", "translation" => "في دريم بارك, تكون الألعاب مناسبة لمختلف الأعمار ومستويات الراحة، مما يوفر تجربة ممتعة للجميع. يمكن للآباء الاسترخاء في مناطق الاستراحة المخصصة بينما يراقبون أطفالهم الذين يستمتعون بالمرح. بالإضافة إلى الألعاب، تقدم الحديقة أيضًا أكشاك لبيع وجبات خفيفة يمكنكم تناولها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1279
            ["id" => "c5d11b45-5ac5-4ef8-8725-255675a52a01", "translation" => "Whether you're looking for relaxation by the pool, fun water games, or simply family fun, the Opla Pool has got you covered.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "84be714c-5bac-4f82-97ca-f4cbc0513528", "translation" => "Que vous soyez en quête de moments de relaxation au bord de la piscine, de jeux aquatiques amusants ou simplement de moments de plaisir en famille, la piscine Opla Pool répondra à vos attentes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f7bf9494-a8e2-49ff-b12b-47dfb9e45274", "translation" => "سواء كنت تبحث عن لحظات الاسترخاء على حافة المسبح، أو ألعاب مائية ممتعة، أو ببساطة لحظات مرح مع العائلة، ستلبي مسبح أوبلا توقعاتك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1280
            ["id" => "7430a800-9ed9-4eca-a608-966ac3f56eb2", "translation" => "This garden is an ideal place to recharge, relax, and admire the natural beauty. Whether it's for a refreshing walk or simply to find a moment of peace.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b97c8b4f-2ca2-4bfc-8ab0-0f3688509e6a", "translation" => "Ce jardin est un endroit idéal pour se ressourcer, se détendre et admirer la beauté naturelle. Que ce soit pour une promenade revigorante ou simplement pour trouver un moment de calme.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9e78917a-c61e-4527-839d-8c4c6415eb02", "translation" => "هذه الحديقة مكان مثالي للاسترخاء والاستمتاع بالجمال الطبيعي. سواء كنت تتجول لتنشيط نفسك أو ببساطة للعثور على لحظة من الهدوء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1281
            ["id" => "73460733-16be-4396-934b-1aeae4c414fe", "translation" => "The Happy Park amusement park, located in the heart of the Ardis shopping center, is a fun and entertaining destination for the whole family. This park offers a wide range of attractions and activities that guarantee moments of happiness and fun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c264fda1-fbd9-4b19-b5f5-60886e4c0427", "translation" => "Le parc d'attractions Happy Park, situé au cœur du centre commercial Ardis, est une destination ludique et divertissante pour toute la famille. Ce parc offre une large gamme d'attractions et d'activités qui garantissent des moments de bonheur et d'amusement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "82bae9b0-5754-4a76-8a54-f13a2928059b", "translation" => "حديقة التسلية هابي بارك، الموجودة في قلب مركز التسوق أرديس، هي وجهة ممتعة وترفيهية للعائلة بأكملها. يقدم هذا المتنزه مجموعة واسعة من الألعاب والأنشطة التي تضمن لحظات من السعادة والمرح.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1282
            ["id" => "9c80df46-7de7-4ed8-9d3d-fe8c2beb7246", "translation" => "The Sabi Park is a small amusement park that provides a fun and entertaining experience for children, with a selection of rides and games that promise moments of enjoyment and adventure.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a4fd4762-5b85-4875-972e-f9b5b1e262b4", "translation" => "Le Sabi Parc est un petit parc d'attractions qui offre une expérience amusante et divertissante pour les enfants, avec une sélection d'attractions et de jeux qui promettent des moments de plaisir et d'aventure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "07d0bc3d-43a1-4e6e-bc1f-f324874dcf55", "translation" => "صابي بارك هو حديقة التسلية صغيرة تقدم تجربة ممتعة ومسلية للأطفال، مع مجموعة متنوعة من الألعاب والألعاب التي تعد بلحظات من المرح والمغامرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1283
            ["id" => "04163c5f-620a-44be-8f0a-1ca7ccf06054", "translation" => "The open air theater of The Sablettes is an enchanting venue that exudes the magic and art of performance. Despite the current lack of performances, this theater continues to shine with its charm and inspiring atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3d37f027-26cb-4afd-912b-26b64b90dd0a", "translation" => "Le théâtre en plein air des Sablettes est un lieu enchanteur qui respire la magie et l'art du spectacle. Malgré le manque de représentations actuelles, ce théâtre continue de rayonner par son charme et son atmosphère inspirante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "20722b9a-b410-48c8-8b1f-82a28e78eed5", "translation" => "مسرح الهواء الطلق في الصابلات هو مكان ساحر يتنفس السحر وفن الأداء. على الرغم من عدم وجود عروض حاليًا، إلا أن هذا المسرح ما زال يشع بجاذبيته وجوهره الملهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1284
            ["id" => "ab383432-80cf-4549-b801-25fe2401799d", "translation" => "Whether you're a resident of Algiers or just passing through, don't miss the opportunity to experience this unique adventure by riding the Ferris wheel. Get ready to be amazed by the breathtaking panoramic view.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ce42bf3d-a03f-4d36-9107-451e057b4aea", "translation" => "Que vous soyez un habitant d'Alger ou un visiteur de passage, ne manquez pas l'occasion de vivre cette expérience unique en montant à bord de la Grande Roue. Préparez-vous à être émerveillé par la vue panoramique époustouflante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "434899f2-9905-4fbd-8964-56e258c1b1a1", "translation" => "سواء كنتم سكان الجزائر أو مجرد زوار عابرين، لا تفوتوا الفرصة لتجربة هذه التجربة الفريدة عند ركوب العجلة الكبيرة. استعدوا للإعجاب بالمناظر البانورامية الرائعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1285
            ["id" => "de0f7849-4be0-48fa-ab0d-4e76f31afbc9", "translation" => "The Carob racecourse, although not as active as it used to be, remains an iconic place in Algiers, full of history and charm. This racecourse, once vibrant with excitement and energy during horse races, still retains its aura and special atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9e0fc430-4ad9-4042-aee8-30829604ada6", "translation" => "L'hippodrome du Caroubier, bien qu'il ne soit plus aussi actif qu'auparavant, reste un lieu emblématique à Alger, chargé d'histoire et de charme. Cet hippodrome, autrefois vibrant d'excitation et d'énergie lors des courses de chevaux, conserve toujours son aura et son atmosphère spéciale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c683df6f-769b-4bbd-8174-ce5f67813960", "translation" => "مضمار سباق الخروبة, على الرغم من أنه لم يعد نشطًا بنفس الطريقة كما كان في السابق، إلا أنه يظل مكانًا رمزيًا في الجزائر، مليئًا بالتاريخ والسحر. يحتفظ هذا المضمار الذي كان يعج بالإثارة والحيوية خلال سباقات الخيول بسحره وجوهره الخاصين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1286
            ["id" => "4936d569-4eb2-4a66-94fd-af86ef24ea30", "translation" => "Whether for a leisurely stroll or simply to recharge, this garden is a must-visit for nature lovers and city dwellers seeking tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d5c223f1-0c05-4549-9544-c2b7773cd5a2", "translation" => "Que ce soit pour une promenade tranquille ou simplement pour se ressourcer, ce jardin est un lieu incontournable pour les amoureux de la nature et les citadins en quête de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "41eb9603-0af8-467e-8a1a-8b5d19913d10", "translation" => "سواء كنتم تبحثون عن نزهة هادئة أو مجرد تجديد للنشاط، هذه الحديقة هي وجهة لا غنى عنها لعشاق الطبيعة وسكان المدينة الذين يبحثون عن السكينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1287
            ["id" => "a055fd3c-a802-483e-9f9a-3211a4dd69c8", "translation" => "The Tafourah garden is home to a wide variety of plants and flowers, providing a stunning visual spectacle. Nature enthusiasts will be delighted to discover diverse botanical species, from fragrant rose beds to exotic trees.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "79cbf14c-b86e-42f5-b87d-afde44fe5086", "translation" => "Le jardin de Tafourah abrite une grande variété de plantes et de fleurs, offrant ainsi un spectacle visuel époustouflant. Les amateurs de nature seront ravis de découvrir des espèces botaniques variées, des massifs de roses parfumées aux arbres exotiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2de54bed-6386-413f-b14b-b979aafbf3a3", "translation" => "حديقة نافورة تحتضن مجموعة كبيرة من النباتات والزهور، مما يوفر عرضًا بصريًا رائعًا. سيكون عشاق الطبيعة مسرورين باكتشاف أنواع نباتية متنوعة، من حدائق الورود العطرية إلى الأشجار الغريبة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1288
            ["id" => "1a3e906b-db1b-497e-aa6e-83ebdb5d0248", "translation" => "The docker statue was erected in memory of the poor dock workers who came to earn their livelihood and who were victims of a cowardly attack by OAS agents. This statue represents a docker in action, symbolizing the hard work and daily struggle of these port workers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fcc55ec7-cc30-4470-a4b2-0449106c8ce4", "translation" => "La statue du docker a été érigée en mémoire des dockers pauvres qui venaient chercher leur gagne-pain et qui ont été victimes d'un attentat lâche perpétré par des agents de l'OAS. Cette statue représente un docker en action, symbolisant le dur travail et la lutte quotidienne de ces travailleurs du port.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fcca23cb-8e13-4044-b60b-12eb4fc3d858", "translation" => "تم نصب تمثال العتال تكريماً لعمال الميناء الفقراء الذين جاؤوا لكسب رزقهم والذين كانوا ضحايا هجوم جبان من قبل عملاء منظمة الجيش السري (OAS). يمثل هذا التمثال عاملاً مينائياً في حالة عمل، رمزاً للعمل الشاق والكفاح اليومي لهؤلاء العمال في الميناء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1289
            ["id" => "c573a456-cafd-4589-a482-4f569a778278", "translation" => "The Tifariti garden is a peaceful oasis in the midst of the city, providing an escape into nature. With its trees, flowers, and pathways, it's a welcoming place for walks, family relaxation, and outdoor activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d83cc4af-d772-4b32-931b-5fe27a836701", "translation" => "Le jardin Tifariti est un havre de paix au milieu de la ville, offrant une évasion dans la nature. Avec ses arbres, ses fleurs et ses sentiers, c'est un endroit accueillant pour les promenades, les moments de détente en famille et les activités de plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1b8f98a3-d65a-4f51-b92b-78db29609e93", "translation" => "حديقة تيفاريتي هي واحة سلام في قلب المدينة، تقدم مفرحة في الطبيعة. مع أشجارها وزهورها وممراتها، إنها مكان مرحب للنزهات والاسترخاء مع العائلة وأنشطة خارجية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1290
            ["id" => "88b10fcf-f800-4121-9f1b-840a6cf2f2d6", "translation" => "Inside the garden, you will find a wide variety of trees, plants, and flowers that create a picturesque and colorful landscape. Winding pathways meander through the flowerbeds, allowing walkers to pleasantly lose themselves in this green oasis.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "566f9859-3511-4a95-a947-0091193ea39f", "translation" => "À l'intérieur du jardin, vous trouverez une grande variété d'arbres, de plantes et de fleurs qui créent un paysage pittoresque et coloré. Des allées sinueuses serpentent à travers les parterres de fleurs, permettant aux promeneurs de se perdre agréablement dans cette oasis de verdure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "16ab50d7-34e1-4940-b4e6-3b448e8e6464", "translation" => "داخل الحديقة، ستجد مجموعة متنوعة من الأشجار والنباتات والزهور التي تخلق مناظر طبيعية جميلة وملونة. الممرات المتعرجة تمر عبر الزهور، مما يسمح للمشاة بأن يضيعوا بلطف في هذا الواحة الخضراء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1291
            ["id" => "cfcd576f-856b-4b61-893f-ec2fbfac7b08", "translation" => "The Algiers fishery is a prestigious and iconic place, considered as an invaluable historical, touristic, and material heritage. This area has played a significant role in attracting tourists to the capital for many years.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9e020e1d-64fe-41af-931a-fe16a6270a96", "translation" => "La pêcherie d'Alger est un lieu prestigieux et emblématique, considéré comme un patrimoine historique, touristique et matériel inestimable. Cet espace a joué un rôle important dans l'attrait touristique de la capitale depuis de nombreuses années.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cda59064-98fb-4550-ad7d-5aaa74943f0a", "translation" => "مسمكة الجزائر العاصمة مكان رفيع المستوى ورمزي، يُعتبر تراثًا تاريخيًا وسياحيًا وماديًا لا يُقدَّر بثمن. شغل هذا المكان دورًا مهمًا في جذب السياح إلى العاصمة على مدى سنوات عديدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1292
            ["id" => "89c8a1a0-83d3-4e37-8a31-97eeb8268338", "translation" => "The Emir Abdelkader square is a gathering place and an important symbol of Algerian history and culture. It is often used as a landmark and meeting point for locals and tourists.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7e7e0540-5d02-4b3a-8534-b5d352623fb3", "translation" => "La place de l'Émir Abdelkader est un lieu de rassemblement et un symbole important de l'histoire et de la culture algérienne. Elle est souvent utilisée comme point de repère et lieu de rencontre pour les habitants et les touristes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e48c6a07-cf47-49cb-8dec-631310b5745a", "translation" => "ساحة الأمير عبد القادر هي مكان للتجمع ورمز هام في تاريخ وثقافة الجزائر. غالبًا ما تُستخدم كعلامة مميزة ومكان للقاء للمحليين والسياح.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1293
            ["id" => "8acca2ff-e6f3-44d8-9b66-699b4d7c00d8", "translation" => "The Floral clock garden is not only a floral and pleasant space, but it also houses a monument steeped in history and symbolism. It is a place of remembrance where visitors can reflect and admire the beauty of this magnificent location.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "89d77a70-f8f0-46f8-9619-16b4b1e26e27", "translation" => "Le jardin de l'horloge florale est non seulement un espace fleuri et agréable, mais il abrite également un monument chargé d'histoire et de symbolisme. C'est un lieu de mémoire où les visiteurs peuvent se recueillir et contempler la beauté de ce lieu magnifique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "31b7a305-7422-4793-8a32-0aae4d992248", "translation" => "حديقة الساعة الزهرية ليست مجرد مكان مليء بالزهور وممتع، بل إنها تضم أيضًا نصبًا تاريخيًا ورمزيًا. إنها مكان للتذكير حيث يمكن للزوار التفكير والتأمل في جمال هذا المكان الرائع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1294
            ["id" => "bb191977-66ee-4ee2-a5d9-c0404ad2f3ae", "translation" => "The Sofia Park is an entertaining and appealing space for children. With its playgrounds, rides, and family-friendly atmosphere, it provides children with the opportunity to play, relax, and create wonderful memories. It's an ideal place for family outings and recreational days.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "630bf13b-cdb6-4664-9f76-59eab8ecb117", "translation" => "Le parc Sofia est un espace divertissant et attractif pour les enfants. Avec ses aires de jeux, ses manèges et son ambiance familiale, il offre aux enfants l'occasion de jouer, de se détendre et de créer de merveilleux souvenirs. C'est un lieu idéal pour les sorties en famille et les journées récréatives.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5a9bd948-7843-4984-88b9-f523d2ecfa6e", "translation" => "حديقة صوفيا هي مكان مسلي وجذاب للأطفال. بفضل الألعاب والجو العائلي، توفر للأطفال فرصة للعب والاسترخاء وخلق ذكريات رائعة. إنها مكان مثالي للرحلات العائلية والأيام الترفيهية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1295
            ["id" => "8f7cdddc-37d9-45ef-909f-0cadfbe6c902", "translation" => "With its exhibitions, events, and contribution to promoting artists, this gallery serves as an essential space for the discovery and appreciation of art in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "71fe6f0f-e225-423b-9a15-57644e723e89", "translation" => "Avec ses expositions, ses événements et sa contribution à la promotion des artistes, cette galerie constitue un espace essentiel pour la découverte et l'appréciation de l'art dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3b552c04-6b3e-4c5d-afcc-00f473425ee9", "translation" => "بفضل معارضها وأحداثها، وإسهامها في تعزيز الفنانين، يعتبر هذا المعرض مساحة أساسية لاكتشاف وتقدير الفن في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1296
            ["id" => "6fa9dccd-0098-4271-b8a7-9eaf31e161a5", "translation" => "Adorned with a bust representing the famous Krim Belkacem, this square is a symbolic public space in Algiers, paying tribute to a leader of the Algerian revolution.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "00b70088-82f4-41c1-b1f2-d68dd87dee9b", "translation" => "Ornée d'un buste représentant le célèbre Krim Belkacem. Cette placette est un espace public symbolique à Alger, rendant hommage à un leader de la révolution algérienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "87385527-6fb9-4a22-936a-df91e2b51ee3", "translation" => "زينت هذه الساحة  بتمثال يمثل الشهير كريم بلقاسم. إنها مساحة عامة رمزية في الجزائر، تكريماً لزعيم من زعماء الثورة الجزائرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1297
            ["id" => "3dc6fb08-5881-4d4f-ae53-cb04359fc709", "translation" => "The Moulin garden is a peaceful little corner of nature in Algiers. With its flowers, trees, and welcoming benches, it provides visitors with a space to relax, rejuvenate, and appreciate the simple beauty of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1d69c4c1-fe2a-4e09-b513-dc59a5423537", "translation" => "Le jardin Moulin est un petit coin de nature paisible à Alger. Avec ses fleurs, ses arbres et ses bancs accueillants, il offre aux visiteurs un espace pour se détendre, se ressourcer et apprécier la beauté simple de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "76680320-699f-4866-866f-5d657de4c32e", "translation" => "حديقة مولان هي ركن صغير من الطبيعة الهادئة في الجزائر. بفضل زهورها وأشجارها ومقاعدها الودية، توفر للزوار مساحة للاسترخاء والاستجمام والاستمتاع ببساطة جمال الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1298
            ["id" => "8725a3d7-d5c7-4a44-8585-4e6aceb414b4", "translation" => "The Port Said square is a green and historic space in Algiers, offering a pleasant place for walking, relaxing, and enjoying the beauty of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "22a9db27-74be-4846-abff-ad22e7b2dc94", "translation" => "Le square Port Saïd est un espace verdoyant et historique d'Alger, offrant un endroit agréable pour se promener, se détendre et profiter de la beauté de la nature,", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d6315a6d-de49-493e-b5e7-067cb78a843b", "translation" => "ساحة بور سعيد هي مساحة خضراء تاريخية في الجزائر العاصمة، وتوفر مكانًا للمشي والاسترخاء والاستمتاع بجمال الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1299
            ["id" => "c822d156-14a7-4e0d-bb99-74b53b47a26e", "translation" => "The martyr's memorial in Adrar is a modest yet powerful monument, serving as a significant place of remembrance, perpetuating the memory of the sacrifices made for the independence of Algeria.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "459aa6f1-4d27-4fea-9728-345a83fdbd3e", "translation" => "Le mémorial du martyr à Adrar est un monument sobre et puissant,  il constitue un lieu de mémoire important, perpétuant le souvenir des sacrifices consentis pour l'indépendance de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "853863cf-b56f-4273-b481-21522759dcfc", "translation" => "مقام الشهيد في أدرار هو نصب بسيط وقوي، يشكل مكانًا هامًا للذكرى، مستمرًا في إحياء ذكرى التضحيات التي تمت من أجل استقلال الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1300
            ["id" => "8bb72de7-52ec-418d-9c91-76b07c6beb0c", "translation" => "The fountain, with its Neptune and moving horses, creates a dynamic and captivating visual effect. It represents the union of strength and elegance and adds an artistic and aesthetic touch to the urban environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ce26d8a3-275e-4385-90fa-e37447c54160", "translation" => "La fontaine, avec son Neptune et ses chevaux en mouvement, crée un effet visuel dynamique et captivant. Elle représente l'alliance de la force et de l'élégance, et ajoute une touche artistique et esthétique à l'environnement urbain.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d85c693c-5991-4432-97cf-68084b87068b", "translation" => "النافورة، بنبتون الذي يظهر مع خيوله المتحركة، تخلق تأثيرًا بصريًا ديناميكيًا وجاذبًا. إنها تمثل تواجد القوة والأناقة معًا وتضيف لمسة فنية وجمالية للبيئة الحضرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1301
            ["id" => "5911d999-2b4b-4cf5-8c93-1f825b4f2521", "translation" => "The Admiralty lighthouse is an impressive and symbolic maritime landmark of Algiers. With its towering structure that also provides magnificent panoramic views, it is a popular destination for visitors looking to admire the beauty of the sea and the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ed8351aa-6291-420b-b1d4-1e25283af156", "translation" => "Le phare de l'Amirauté est un repère maritime impressionnant et symbolique d'Alger. Avec sa tour élancée qui offre également une vue panoramique magnifique. Il est un lieu prisé par les visiteurs qui souhaitent admirer la beauté de la mer et de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "05890733-31da-4949-8139-aa13218479ca", "translation" => "منارة الأميرالية هي علامة بحرية رائعة ورمزية في الجزائر. بفضل برجها الطويل الذي يوفر أيضًا مناظر بانورامية رائعة، فهي وجهة مشهورة للزوار الذين يتطلعون لمشاهدة جمال البحر والمدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1302
            ["id" => "f1481718-670d-4c3d-956e-cabee7046fae", "translation" => "This historic building bears witness to past events and reflects the architecture and history of the region. Its restoration has helped preserve its heritage and showcase it, thereby contributing to the preservation of Algiers' cultural heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6c7b70cc-0784-4156-81f4-4c3e2b248d8e", "translation" => "Ce bâtiment historique est le témoin d'événements passés et reflète l'architecture et l'histoire de la région. Sa restauration a permis de préserver son patrimoine et de le mettre en valeur, contribuant ainsi à la préservation du patrimoine culturel d’Alger.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1ee8f6ef-1396-402e-9e6f-3fa14f82e049", "translation" => "هذا المبنى التاريخي يشهد الأحداث الماضية ويعكس الهندسة المعمارية وتاريخ المنطقة. أسهمت عمليات ترميمه في الحفاظ على تراثه وعرضه، مما ساهم في الحفاظ على التراث الثقافي لمدينة الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1303
            ["id" => "386219e9-b96b-47ff-b013-d1456bd0b150", "translation" => "The square is characterized by modern architecture and meticulous landscaping. It provides a panoramic view of the sea, allowing visitors to admire the glistening waters and appreciate the natural beauty of the coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "09774271-181d-424c-9f34-98ae1f44a468", "translation" => "La place est caractérisée par une architecture moderne et un aménagement paysager soigné. Elle offre une vue panoramique sur la mer, permettant aux visiteurs d'admirer les eaux scintillantes et d'apprécier la beauté naturelle de la côte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "669b6a0e-9f8a-4dfd-9e9b-7c3c1fd6bb74", "translation" => "الساحة مميزة بعمارتها الحديثة وتصميمها المُرتب. إنها توفر إطلالة بانورامية على البحر، مما يسمح للزوار بمشاهدة مياهه اللامعة والاستمتاع بجمال الساحل الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1304
            ["id" => "4900e9e9-b832-456f-8883-825d99a0d23f", "translation" => "The Taleb Abderrahmane garden is a green and peaceful space in Algiers. With its well-maintained areas, welcoming benches, and natural beauty, it offers visitors a haven of peace in the heart of the city. It's an ideal place to relax, connect with nature, and enjoy a moment of tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f6859121-e044-4c64-85e2-e7ab32d0258a", "translation" => "Le jardin Taleb Abderrahmane est un espace verdoyant et apaisant à Alger. Avec ses espaces bien entretenus, ses bancs accueillants et sa beauté naturelle, il offre aux visiteurs un havre de paix au cœur de la ville. C'est un lieu idéal pour se détendre, se connecter avec la nature et profiter d'un moment de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cea962e7-db80-4db5-8441-91994efef80d", "translation" => "حديقة طالب عبد الرحمان هي مساحة خضراء هادئة في الجزائر العاصمة. بفضل مناطقها المحافظة بشكل جيد، ومقاعدها الودية، وجمالها الطبيعي، تقدم للزوار مأوى للسلام في قلب المدينة. إنها مكان مثالي للاسترخاء والتواصل مع الطبيعة والاستمتاع بلحظة من الهدوء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1305
            ["id" => "40649197-8685-4b1e-ab19-483e7194eb02", "translation" => "El Kettani swimming pool is a place of relaxation and leisure in Algiers. With its facilities, it provides residents and visitors with a pleasant place to swim, relax, and spend time with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e54b3585-41b3-4241-9e82-4aa044edca69", "translation" => "La piscine el Kettani est un lieu de détente et de loisirs à Alger. Avec ses installations, elle offre aux habitants et aux visiteurs un endroit agréable pour nager, se relaxer et passer du temps en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d262c744-8967-4998-9d4f-f302d772c658", "translation" => "مسبح كيتاني هو مكان للاسترخاء والترفيه في الجزائر العاصمة. بفضل تجهيزاته، يوفر هذا المكان للسكان المحليين والزوار مكانًا لطيفًا للسباحة والاسترخاء وقضاء وقت ممتع مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1306
            ["id" => "c3226317-c4fa-45e7-b5da-743b99b18031", "translation" => "The natural beauty of El Kettani beach and its picturesque location make it a favorite destination for local residents and tourists looking for a sunny and refreshing getaway.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2ac55298-1e54-4eda-917f-f44cf517be6a", "translation" => "La beauté naturelle de la plage el Kettani et son emplacement pittoresque en font un lieu de prédilection pour les habitants locaux et les touristes à la recherche d'une escapade ensoleillée et rafraîchissante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "61965736-7a12-40d7-8a46-467f7daa3b96", "translation" => "جمال الطبيعة في شاطئ كيتاني وموقعه الخلاب يجعلانه مكانًا مفضلًا للسكان المحليين والسياح الذين يبحثون عن إجازة مشمسة ومنعشة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1307
            ["id" => "5950b137-986a-426e-91a9-6a1972245e58", "translation" => "This statue is a visual reminder of the history of the city of Algiers and the contribution of Bologhine Ibn Ziri to its development and foundation. It commands respect and admiration while providing visitors with an opportunity to connect with the region's past.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ac84b84a-be37-429e-94d2-bb60a106ded9", "translation" => "Cette statue est un rappel visuel de l'histoire de la ville d'Alger et de la contribution de Bologhine Ibn Ziri à son développement et à sa fondation. Elle suscite le respect et l'admiration, tout en offrant aux visiteurs une occasion de se connecter avec le passé de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c4d30876-bff4-4d7b-ae19-7c7e6c5ea13e", "translation" => "هذه التمثال هو تذكير بصري لتاريخ مدينة الجزائر وإسهام بولوغين بن زيري في تطويرها وتأسيسها. إنه يستحوذ على الاحترام والإعجاب، مما يوفر للزوار فرصة للتواصل مع ماضي المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1308
            ["id" => "8eaf84bd-5ad5-4ab0-bffa-7a16f2f678eb", "translation" => "The Eden beach is a popular spot for relaxation, swimming, and sunbathing. Visitors can lay on the warm sand, sunbathe, read a book, or simply relax while listening to the gentle sound of the waves.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "758be8f5-22ae-425f-9467-f54ac4144f74", "translation" => "La plage Eden est un lieu populaire pour se détendre, se baigner et profiter du soleil. Les visiteurs peuvent s'installer sur le sable chaud, bronzer, lire un livre ou simplement se relaxer en écoutant le doux bruit des vagues.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9e9e3bbc-4fcd-405f-8528-d0bd52284e21", "translation" => "شاطئ ليدان هو مكان شهير للاسترخاء والسباحة والتمتع بأشعة الشمس. يمكن للزوار أن يستلقوا على الرمال الدافئة، ويستمتعوا بأشعة الشمس، و يقرأوا كتبًا، أو يسترخوا ببساطة أثناء الاستماع إلى صوت الأمواج اللطيف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1309
            ["id" => "e85821e1-b67f-4309-aff8-dc49fe9e13bd", "translation" => "The Malakoff garden is a peaceful haven in Algiers. With its green setting, tranquil paths, and a view of the sea, it provides visitors with a pleasant space to relax, stroll, and enjoy nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b340a36c-59c0-41c3-9cc2-6cd14b8f8128", "translation" => "Le jardin Malakoff est un havre de paix à Alger. Avec son cadre verdoyant, ses sentiers tranquilles et sa vue sur la mer, il offre aux visiteurs un espace agréable pour se détendre, se promener et profiter de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "07dfaf55-45a4-48e6-b7ff-da77d670ff8d", "translation" => "حديقة مالاكوف هي ملاذ هادئ في الجزائر. بفضل محيطها الأخضر وممراتها الهادئة وإطلالتها على البحر، توفر للزوار مكانًا لطيفًا للاسترخاء والتجول والاستمتاع بالطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1310
            ["id" => "a3a74209-2d34-4f2b-9c69-b5b7b8d048f6", "translation" => "With its compact size and fine sand, it provides visitors with a pleasant setting to spend time by the sea. It's an ideal place to relax and enjoy the coastal atmosphere of the area.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aafccdab-995f-469d-b12d-17a269d5cc59", "translation" => "Avec ses dimensions compactes et son sable fin, elle offre aux visiteurs un cadre agréable pour passer du temps en bord de mer. C'est un endroit idéal pour se détendre et profiter de l'atmosphère balnéaire de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9ab2bf41-d75a-46f8-9f0d-5743dea80a21", "translation" => "بفضل أبعادها المدمجة ورمالها الناعمة، توفر للزوار بيئة لطيفة لقضاء وقت على شاطئ البحر. إنها مكان مثالي للاسترخاء والاستمتاع بجو الساحل في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1311
            ["id" => "3af6b95c-d6e1-47a5-a966-de6aa9fc9fe4", "translation" => "The Rais Hamidou beach is a coastal gem in Algiers, offering a beautiful natural setting, clear waters, and a relaxing atmosphere. Enjoy moments of relaxation, swimming, and leisure with family or friends, and let yourself be captivated by the beauty of this exceptional place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "98a0f27d-522c-4eeb-a332-37db01d331e2", "translation" => "La plage Rais Hamidou est un joyau côtier à Alger, offrant un cadre naturel magnifique, des eaux claires et une ambiance relaxante. Profitez de moments de détente, de baignade et de loisirs en famille ou entre amis, et laissez-vous imprégner par la beauté de ce lieu exceptionnel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ca61f1f1-d8e8-4d58-a739-2b7459a62a90", "translation" => "شاطئ رايس حميدو جوهرة ساحلية في الجزائر، حيث يقدم إطارًا طبيعيًا جميلًا، ومياهًا صافية، وجوًا مريحًا. استمتع بلحظات الاسترخاء والسباحة والترفيه مع العائلة أو الأصدقاء، واسمح لنفسك بأن تتسحر بجمال هذا المكان الاستثنائي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1312
            ["id" => "fd3a2294-955a-42c3-8e0c-20b5ea4c8816", "translation" => "The Vigie beach provides visitors with a space to sunbathe and enjoy the pleasures of the beach. Whether you want to swim, engage in water activities, or simply relax while admiring the sea view, this beach offers an unforgettable experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4bf56a52-70d7-422b-b5a6-25881bf6738d", "translation" => "La plage de la Vigie offre aux visiteurs un espace pour se prélasser au soleil et profiter des joies de la plage. Que vous souhaitiez vous baigner, vous adonner à des activités aquatiques ou simplement vous détendre en admirant la vue sur la mer, cette plage offre une expérience inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e6b68769-7490-4453-b701-f31dbd3500fb", "translation" => "شاطئ لافيجي يوفر للزوار مساحة للتشمس والاستمتاع بمتع الشاطئ. سواء كنت ترغب في السباحة أو ممارسة أنشطة مائية أو ببساطة الاسترخاء والتمتع بإطلالة البحر، يقدم هذا الشاطئ تجربة لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1313
            ["id" => "a1ca60e3-1baf-447b-89e7-72564e1bef07", "translation" => "With its fine sand, lack of erosion, and moderate capacity, it provides visitors with an ideal setting to relax and swim in a peaceful atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9d13145d-8f20-4221-b3da-6aa9031b92ee", "translation" => "Avec son sable fin, son absence d'érosion et sa capacité d'accueil modérée, elle offre aux visiteurs un cadre idéal pour se détendre et se baigner dans une atmosphère paisible.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bdf0c236-0de2-42f8-8113-181b14d2064e", "translation" => "بفضل رماله الناعمة وعدم تعرضه للتآكل وسعته المعتدلة، يوفر هذا الشاطئ مكانًا مثاليًا للزوار للاسترخاء والسباحة في جو هادئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1314
            ["id" => "a9407703-3251-456b-a12b-722711b32c30", "translation" => "The la pointe beach is a lively place where you can observe water sports enthusiasts enjoying their favorite activities. The atmosphere is friendly, and you can soak up the positive energy that prevails on the beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "164953c2-3265-4fef-9a8a-53738d926567", "translation" => "La plage de la pointe est un lieu animé où vous pourrez observer les passionnés de sports nautiques s'adonner à leurs activités préférées. L'ambiance est conviviale et vous pourrez profiter de l'énergie positive qui règne sur la plage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cdb662b0-1ec4-47db-9d4d-55e47c653a39", "translation" => "شاطئ لابوانت هو مكان حيث يمكنك مشاهدة عشاق الرياضات المائية وهم يمارسون أنشطتهم المفضلة. الجو مرح ويمكنك الاستمتاع بالطاقة الإيجابية التي تسود على الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1315
            ["id" => "7e4c8b31-5a49-4283-ae34-2f3dbe839498", "translation" => "The Miramar beach is a little piece of paradise with its coarse sand and bay-like shape, offering visitors a unique beach experience. Come and enjoy moments of relaxation, swimming, and tranquility on this charming beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9072e5a3-975f-4499-a106-92c81e5ef9c7", "translation" => "La plage Miramar est un petit coin de paradis avec son sable grossier et sa forme en baie, elle offre aux visiteurs une expérience de plage unique. Venez profiter de moments de détente, de baignade et de tranquillité dans cette plage au charme particulier.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2dd1cd21-ee0f-43f2-a9fe-1d53321a6806", "translation" => "شاطئ ميرامار هو قطعة صغيرة من الجنة برماله الخشنة وشكله الخاص كالخليج، حيث يقدم تجربة فريدة للزوار. تعالوا واستمتعوا بلحظات الاسترخاء والسباحة والهدوء على هذا الشاطئ الساحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1316
            ["id" => "19c81d4c-d655-4f9d-a256-2fc6fcefd73d", "translation" => "The fishing port of Raïs Hamidou is a bustling place where the fishing industry takes center stage. With its colorful boats, passionate fishermen, and authentic atmosphere, it provides visitors with a glimpse into the local maritime life and the richness of the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f1f6c429-4500-481f-a0c0-00a9769845ff", "translation" => "Le port de pêche de Raïs Hamidou est un lieu animé où l'industrie de la pêche est à l'honneur. Avec ses bateaux colorés, ses pêcheurs passionnés et son ambiance authentique, il offre aux visiteurs un aperçu de la vie maritime locale et de la richesse de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "12f88560-6ed2-4a33-8bf7-3adce62ad39a", "translation" => "ميناء صيد رايس حميدو هو مكان حيوي حيث يتصدر صناعة الصيد الأهمية. بفضل قواربه الملونة وصياديه المتحمسين وأجوائه الأصيلة، يقدم هذا المكان للزوار نظرة عابرة على حياة البحر المحلية وثراء البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1317
            ["id" => "ed4db089-d005-4d41-bd13-e456b688fd13", "translation" => "Due to its small size, the La reserve beach creates an intimate and exclusive atmosphere. Visitors can enjoy a peaceful space to sunbathe, swim in the refreshing waters, or explore the picturesque surroundings.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c7f0d885-05fd-4b51-8583-a13dc7b4ba4e", "translation" => "En raison de sa petite taille, la plage de la réserve crée une ambiance intime et exclusive. Les visiteurs peuvent profiter d'un espace tranquille pour se prélasser au soleil, se baigner dans les eaux rafraîchissantes ou explorer les environs pittoresques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9eaabdcc-631d-4c8a-9681-d9d3e7922956", "translation" => "نظرًا لحجمها الصغير، يخلق شاطئ لا ريزيرف أجواء حميمة وحصرية. يمكن للزوار الاستمتاع بمساحة هادئة للتشمس، والسباحة في المياه المنعشة، أو استكشاف المحيطات الجميلة من حولهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1318
            ["id" => "b474d8eb-2c13-4ed0-b535-7b0a6ad56243", "translation" => "Whether you want to swim, sunbathe, or simply take a leisurely stroll along the shoreline, the Bainem beach offers a pleasant and relaxing experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e729eb74-3a81-4250-a142-1ce10a13b2cf", "translation" => "Que vous souhaitiez vous baigner, bronzer ou simplement vous promener le long du rivage, la plage de Bainem vous offre une expérience agréable et relaxante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "275a8cae-edb2-4031-9d23-1364efa38a58", "translation" => "سواء كنت ترغب في السباحة، أو التشمس، أو مجرد التجول على طول الشاطئ، يقدم شاطئ باينام تجربة لطيفة ومريحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1319
            ["id" => "1f66243f-a529-40bf-a738-ab38e0a4a527", "translation" => "This beach provides a peaceful environment, perfect for escaping the stresses of daily life. With its fine sand and clear sea, it's ideal for relaxation, strolling along the coast, or simply enjoying the sun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ccbb6e8f-7dd4-42ae-ba61-ec3aed01a705", "translation" => "Cette plage offre un environnement paisible, parfait pour échapper au stress de la vie quotidienne. Avec son sable fin et sa mer claire, elle est idéale pour se détendre, se promener le long de la côte ou simplement profiter du soleil.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "902ae175-dc23-43b8-b3b3-089e37d1477b", "translation" => "يقدم هذا الشاطئ بيئة هادئة، مثالية للهروب من ضغوطات الحياة اليومية. بفضل رماله الناعمة وبحره الصافي، فهو مثالي للاسترخاء، والتجول على طول الساحل، أو ببساطة الاستمتاع بالشمس.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1320
            ["id" => "4b047d69-2411-4f90-a32f-00fa471feca1", "translation" => "Whether you want to sunbathe, explore the rocky surroundings, or enjoy a refreshing swim, the Three benches beach is an ideal place to spend unforgettable moments in harmony with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a5ca2dcb-9286-43f3-b8e4-7b63ec0515f9", "translation" => "Que vous souhaitiez vous prélasser au soleil, explorer les environs rocheux ou profiter d'une baignade rafraîchissante, la plage des Trois Bancs est un lieu idéal pour passer des moments inoubliables en harmonie avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b930048a-88b5-4d2c-a7f6-d13b80e3b6b3", "translation" => "سواء كنت ترغب في التمدد تحت أشعة الشمس، استكشاف المناطق الصخرية المحيطة، أو الاستمتاع بسباحة منعشة، فإن شاطئ المقاعد الثلاثة هو المكان المثالي لقضاء لحظات لا تُنسى في انسجام تام مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1321
            ["id" => "dec875b0-59ab-473d-b86a-4a2a355283f9", "translation" => "The Lighthouse beach is a true coastal gem in the form of a cove that provides an enchanting setting to enjoy the coastline. You can indulge in swimming in the clear waters and relish the seaside pleasures in complete safety.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9e86cb84-b116-4967-80a0-b146bd56ec97", "translation" => "La plage du Phare est un véritable joyau côtier en forme de crique qui offre un cadre enchanteur pour profiter du littoral. Vous pourrez vous adonner à la baignade dans les eaux claires et profiter des plaisirs balnéaires en toute sécurité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e7e5330c-3a87-4809-98c2-daaa067d2800", "translation" => "شاطئ المنار هو جوهرة ساحلية حقيقية على شكل خليج تقدم إطارًا ساحرًا للاستمتاع بساحل البحر. يمكنك الاستمتاع بالسباحة في المياه الواضحة و التمتع بلذائذ الشاطئ بأمان تام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1322
            ["id" => "16e89db4-a9b9-44b1-9535-f642146ec6df", "translation" => "The Big rock beach, formerly known as 'Dominique' offers a unique blend of sand and rocks, creating a picturesque and captivating landscape. Whether you prefer to lounge on the sand or explore the rocks, this beach invites you to experience moments of tranquility and enjoyment by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a3c97359-0809-49c6-8b74-ea8920324f3d", "translation" => "La plage du Grand Rocher, anciennement connue sous le nom de 'Dominique' offre un mélange unique de sable et de rochers, créant un paysage pittoresque et captivant. Que vous préfériez vous allonger sur le sable ou explorer les rochers, cette plage vous invite à vivre des moments de tranquillité et de plaisir au bord de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "99c1f056-5f24-47f9-983d-1291b8ce8021", "translation" => "شاطئ الصخرة الكبيرة, المعروف سابقًا بـ 'دومينيك'، يقدم مزيجًا فريدًا من الرمال والصخور، مما يخلق منظرًا جميلًا وساحرًا. سواء كنتم تفضلون الاستلقاء على الرمال أو استكشاف الصخور، يدعوكم هذا الشاطئ إلى تجربة لحظات من الهدوء والاستمتاع على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1323
            ["id" => "7a147f29-7c7e-4024-8fcc-2b03e7093f0c", "translation" => "The Islet beach invites relaxation and tranquility with its prime location, offering magnificent views of the Madrague islet and the surrounding waters.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "192df71f-5ed6-4379-8c28-d15f4e5dd482", "translation" => "La plage de l’îlot invite à la détente et à la relaxation en bénéficiant d'un emplacement privilégié, elle offre une vue magnifique sur l'îlot de la Madrague et les eaux environnantes. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4088a188-1e51-47ef-92b8-3d0a41f2393b", "translation" => "شاطئ الجزيرة الصغيرة يدعو إلى الاسترخاء والهدوء بفضل موقعه المتميز، حيث يقدم إطلالات رائعة على جزيرة لامادراڤ والمياه المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1324
            ["id" => "eeffc058-3071-47ed-a0d8-3ca39e43cbad", "translation" => "This artificial beach provides fine and soft sand, recreating the atmosphere of a natural beach. With its modern and comfortable facilities, it is perfect for sunbathing, swimming, and enjoying water activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "abce9286-37c0-4c8f-ab8e-05b1d206a964", "translation" => "Cette plage artificielle offre du sable fin et doux, recréant l'atmosphère d'une plage naturelle. Avec ses installations modernes et confortables, elle est parfaite pour se prélasser au soleil, se baigner et profiter d'activités nautiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "00e6307c-5f76-410d-a234-6b284798af4c", "translation" => "يقدم هذه الشاطئ الاصطناعي رمالاً ناعمة، مما يعيد إنشاء أجواء الشاطئ الطبيعي. بفضل مرافقها الحديثة والمريحة المثالية للتمدد تحت أشعة الشمس، والسباحة، والاستمتاع بأنشطة مائية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1325
            ["id" => "e177dc76-f74f-4674-886d-beb067727907", "translation" => "The La Madrague port is a meeting place for sailing and fishing enthusiasts, offering an authentic maritime atmosphere. You can admire the colorful boats moored in the port, enjoy local seafood restaurants, or simply stroll along the docks and take in the sea view.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1e7c50bd-f651-4667-ba65-d57cc76ba41f", "translation" => "Le port de la Madrague est un lieu de rencontre pour les passionnés de navigation et de pêche, offrant une atmosphère maritime authentique. Vous pourrez admirer les bateaux colorés amarrés dans le port, profiter des restaurants de fruits de mer locaux ou simplement vous promener le long des quais et profiter de la vue sur la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cec4761d-af7c-4cd7-be3f-b003af5725ff", "translation" => "ميناء لامادراڤ هو مكان للاجتماع لهواة الملاحة والصيد، حيث يقدم أجواء بحرية أصيلة. يمكنكم معاينة القوارب الملونة المرسوة في الميناء، والاستمتاع بالمطاعم المحلية التي تقدم المأكولات البحرية، أو ببساطة التجول على ضفاف المرافئ والاستمتاع بإطلالة البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1326
            ["id" => "ecd00b52-ecd9-497d-a8ec-9cf8c8c02eeb", "translation" => "Discover the La Madrague beach, also known as the big beach, a must-visit destination for beach vacation enthusiasts. This beautiful stretch of sand will provide you with an exceptional coastal experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7ffc9cb1-c209-4bd6-be2b-2013b6b6cda9", "translation" => "Découvrez la plage de la Madrague, également connue sous le nom de Grande Plage, une destination incontournable pour les amateurs de vacances balnéaires. Cette magnifique étendue de sable vous offrira une expérience côtière exceptionnelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "78cbb440-76e6-43dc-bad1-e52bc39659d2", "translation" => "اكتشف شاطئ لامادراڤ, المعروف أيضًا باسم الشاطئ الكبير، وهو وجهة لا غنى عنها لعشاق عطلات على الشاطئ. ستقدم لك هذه المساحة الرملية الرائعة تجربة ساحلية استثنائية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1327
            ["id" => "2dbf85be-9b4b-4b3e-bd84-c254945cbddc", "translation" => "The Youth beach is a small rocky beach favored by local residents. Although it has very little sand, it is highly popular among locals for its tranquility and friendly atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4f14f51d-eb25-4a1b-a88c-e7b5fb75fe4b", "translation" => "La plage Jeunesse est une petite plage rocheuse appréciée par les habitants locaux. Bien qu'elle dispose de très peu de sable, elle jouit d'une grande popularité parmi les riverains pour sa tranquillité et son ambiance conviviale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1c6e1bb0-bf7c-4f52-8974-521c169845a1", "translation" => "شاطئ الشباب هو شاطئ صغير وصخري يفضله السكان المحليون. على الرغم من أنه يحتوي على قليل جدًا من الرمل، إلا أنه يحظى بشعبية كبيرة بين السكان المحليين بسبب هدوئه وأجوائه الودية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1328
            ["id" => "f0b469d9-d140-408f-ac94-fd6bf538daf6", "translation" => "The La Fontaine beach is a charming rocky and family-friendly beach. Due to the configuration of the rocks, the sea is calmer, providing a relaxing environment for fishing and for enthusiasts of underwater diversity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bceb9690-0a10-4765-8d75-2be766f779a1", "translation" => "La plage de La Fontaine est une charmante plage rocheuse et familiale. Grâce à la configuration des rochers, la mer y est plus calme, offrant un environnement propice à la détente et à la pêche pour les amateurs de diversité sous-marine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ec403211-f356-40b9-96ca-981adf288609", "translation" => "شاطئ لافونتان هو شاطئ صخري ساحر ومناسب للعائلات. بفضل تكوين الصخور، يكون البحر هنا هادئًا أكثر، مما يوفر بيئة مريحة لصيد الأسماك ولهواة التنوع تحت الماء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1329
            ["id" => "63ccedb3-2fd8-41a9-8c1c-451968310ba6", "translation" => "The Clockids Palace is an indoor amusement park that offers a complete experience of fun and entertainment. This amusement and sports park offers a variety of activities for children. From thrilling rides to interactive games, you will find plenty of options for entertainment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4f3825a8-719f-49d8-80ac-b6b1c7268fae", "translation" => "Le Clockids Palace est un parc de loisirs en intérieur qui offre une expérience complète en matière d'amusement et de divertissement. Ce parc d'attractions et de sports propose une variété d'activités pour les enfants. Des manèges excitants aux jeux interactifs, vous y trouverez de nombreuses options pour vous divertir.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a072a006-1055-402b-9600-f3084ae15429", "translation" => "قصر كلوكيدز هو متنزه ترفيهي داخلي يقدم تجربة كاملة من المرح والتسلية. يقدم هذا المتنزه للألعاب والرياضات مجموعة متنوعة من الأنشطة للأطفال. من الألعاب المثيرة إلى الألعاب التفاعلية، ستجد العديد من الخيارات للترفيه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1330
            ["id" => "58306cad-226a-4a91-a5eb-4e422505213c", "translation" => "The Club des Pins beach is a private beach with very limited access. It is located within the Sahel Residence, which is the official residence of the Head of State.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aeb11a64-5fe0-4ea4-a8ba-65fd62467f02", "translation" => "La plage du Club des Pins est une plage privée avec un accès très restreint. Elle est située au sein du territoire de la résidence Sahel, qui est la résidence du chef de l'État.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0ceb7421-afc9-4442-8f74-d7f128453f9e", "translation" => "شاطئ نادي الصنوبر هو شاطئ خاص بالوصول مقيد للغاية. يقع داخل إقامة الساحل، وهو إقامة رئيس الدولة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1331
            ["id" => "09bad02c-f514-4cd4-97ba-8a0ecd7e5487", "translation" => "The Teri Park is the perfect place for an enjoyable and entertaining family outing. You'll find a variety of classic and modern attractions suitable for all ages, such as bumper cars, a carousel, a roller coaster, an arcade, a ropes course, and virtual reality games. With over 21 attractions, the Teri Park offers a wide range of games for everyone's enjoyment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3575a19d-66f7-4251-9779-a30b5c472a72", "translation" => "Le Teri Park est le lieu idéal pour une sortie en famille agréable et divertissante. Vous trouverez une variété d'attractions classiques et modernes, adaptées à tous les âges, telles que des voitures tamponneuses, un carrousel, un coaster, une salle d'arcade, un accrobranche et des jeux de réalité virtuelle. Avec plus de 21 attractions, le Teri Park offre une grande diversité de jeux pour le plaisir de chacun.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4984dda4-f2e2-458c-8484-1149aa1f5e91", "translation" => "تيري بارك هو المكان المثالي للخروج مع العائلة لقضاء وقت ممتع ومسلي. ستجد مجموعة متنوعة من الألعاب التقليدية والحديثة مناسبة لجميع الأعمار، مثل السيارات المصدمة، والسفينة المرتفعة، وقاعة الألعاب، ومسار الحبال. مع أكثر من 21 معلماً ترفيهي، يقدم تيري بارك مجموعة متنوعة من الألعاب لمتعة الجميع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1332
            ["id" => "13ffdce5-ed7a-4d76-aa76-3007f027ee1b", "translation" => "The Des Cars wood is a true haven of greenery. This wooded park provides a preserved and peaceful natural space, perfect for escaping the hustle and bustle of the city. With its vast stretches of trees, lawns, and trails, this place invites relaxation and outdoor strolls.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5007fa09-e40f-43f4-9e71-4f329dc1167e", "translation" => "Le bois des Cars est un véritable havre de verdure. Ce parc boisé offre un espace naturel préservé et paisible, idéal pour s'évader de l'agitation de la ville. Avec ses vastes étendues d'arbres, de pelouses et de sentiers, ce lieu invite à la détente et à la promenade en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b4d76c18-fbe6-461e-a950-b0e1631d9947", "translation" => "حديقة ديكار هي ملاذ حقيقي. هذا الحديقة الخضراء المكسوة بالأشجار توفر مساحة طبيعية محافظة ومسالمة، مثالية للهروب من صخب المدينة. مع مساحاتها الشاسعة من الأشجار والعشب والمسارات، يُدعى هذا المكان للاسترخاء والنزهات في الهواء الطلق", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1333
            ["id" => "9953e9aa-7199-4ad0-b5ff-7bcdd41ba5ba", "translation" => "The Laser Strike provides an exceptional laser tag gaming experience. It's the perfect place for action and adrenaline enthusiasts. Participants can engage in thrilling laser battles, testing their accuracy and strategy.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0d4768d6-598f-4232-a0fd-19fb4c665702", "translation" => "Le Laser Strike offre une expérience de jeu de tir laser exceptionnelle. C'est l'endroit idéal pour les amateurs d'action et d'adrénaline. Les participants peuvent s'affronter dans des batailles laser palpitantes, mettant à l'épreuve leur précision et leur stratégie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "75a34d44-a324-4b6a-a4e3-e8ffd325c757", "translation" => "ليزر سترايك يقدم تجربة استثنائية في لعبة الليزر تاغ. إنه المكان المثالي لعشاق الأدرينالين. يمكن للمشاركين المشاركة في معارك ليزر مثيرة، مما يختبر دقتهم واستراتيجيتهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1334
            ["id" => "4ee1c9ba-7024-4237-acf8-22f3b4958a2d", "translation" => "Whether you're a novice or an experienced driver, you can enjoy thrills and test your driving skills on the track.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3be8077e-5300-4b8d-8a35-6c69f6e84aaa", "translation" => "Que vous soyez un pilote débutant ou expérimenté, vous pourrez profiter de sensations fortes et tester vos compétences de pilotage sur le circuit.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a7276503-688b-4230-b1cd-f62f5eb535fd", "translation" => "سواء كنت سائقًا مبتدئًا أو متمرسًا، يمكنك الاستمتاع بالإثارة واختبار مهارات القيادة الخاصة بك على المضمار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1335
            ["id" => "9902bdd6-ca01-493b-95a0-45599da90380", "translation" => "The el Kounouz art gallery showcases the talent of various artists, providing a platform for their creativity and artistic expression, promising visitors an enriching and inspiring experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "84dd571e-580d-448f-9b43-0ef666d0c46d", "translation" => "La galerie d'art el Kounouz expose le talent de différents artistes, elle offre ainsi une vitrine pour leur créativité et leur expression artistique et promet aux visiteurs une expérience enrichissante et inspirante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "27b76818-337d-44e8-8c53-ec961f549b36", "translation" => "معرض الفن الكنوز يعرض مواهب فنانين متنوعين، ويقدم منصة لإبداعهم وتعبيرهم الفني، مما يعد الزوار بتجربة غنية وملهمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1336
            ["id" => "02f2c7f3-482e-4a53-bb5a-4a641c91d050", "translation" => "The Teri Park Arcade is a highly regarded spot for gaming enthusiasts, particularly because of its captivating 3D space. It's the perfect place for those seeking a gaming experience that's different from traditional amusement parks.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a1303b3f-50df-4a92-a3ea-04255b048eee", "translation" => "Le Teri Park Arcade est un lieu très apprécié des amateurs de jeux, notamment grâce à son espace 3D captivant. C'est l'endroit idéal pour ceux qui recherchent une expérience de jeu différente des parcs traditionnels.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "69831354-2da8-41ac-84c9-51a6edc113f4", "translation" => "تيري بارك أركاد هي مكان محبوب لهواة الألعاب، وذلك بفضل مساحتها ثلاثية الأبعاد المثيرة. إنه المكان المثالي لأولئك الذين يبحثون عن تجربة ألعاب تختلف عن الحدائق الترفيهية التقليدية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1337
            ["id" => "3e51be57-0a99-4b21-830a-a67b5083f711", "translation" => "This fine sandy beach stretches over a significant length and provides ample space to relax and soak up the sun. Swimming is allowed here, allowing you to cool off in the clear waters. Enjoy this beautiful beach for pleasant moments with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1a8af253-09a2-4519-9f57-10801f003dc6", "translation" => "Cette plage de sable fin s'étend sur une longueur importante et offre un espace généreux pour se détendre et profiter du soleil. La baignade y est autorisée, vous permettant de vous rafraîchir dans les eaux claires. Profitez de cette belle plage pour passer des moments agréables en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d1ecdd4e-e6e7-4912-a65d-c1c3a8f2bc15", "translation" => "هذا الشاطئ الرملي الناعم يمتد على طول مسافة هامة ويوفر مساحة واسعة للاسترخاء والاستمتاع بأشعة الشمس. السباحة مسموح بها هنا، مما يتيح لك التبريد في المياه الصافية. استمتع بهذا الشاطئ الجميل لقضاء لحظات ممتعة مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1338
            ["id" => "bf0f2582-cd9f-44ed-bd32-8488ffdfadd2", "translation" => "The Palm beach is a popular destination for the people of Algiers during the summer season and offers an idyllic setting to relax and have fun with family or friends. Come and discover this beautiful beach and enjoy an unforgettable seaside getaway.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "46171bae-dbf7-4ba3-a9ca-97190e8de06e", "translation" => "La plage de Palm Beach est un lieu prisé des Algérois pendant la saison estivale et offre un cadre idyllique pour se ressourcer et se divertir en famille ou entre amis. Venez découvrir cette magnifique plage et profitez d'une escapade balnéaire inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6daee810-2121-4d69-a76f-f88a873e98ed", "translation" => "شاطئ النخيل هو وجهة مفضلة لأهالي الجزائر خلال موسم الصيف ويقدم إطارًا جميلاً للاسترخاء والتسلية مع العائلة أو الأصدقاء. تعال واكتشف هذا الشاطئ الجميل واستمتع بإجازة على الشاطئ لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1339
            ["id" => "13e4544f-773f-466b-9c68-b6986ba5f280", "translation" => "With its architecture blending modernism and Algerian traditions, this historically rich port is a must-visit during your trip. Enjoy its unique atmosphere and breathtaking view of the Mediterranean Sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "08f9d50a-94a5-40d0-b05c-cb0d5fce0508", "translation" => "Avec son architecture alliant modernisme et traditions algéroises, ce port chargé d'histoire est un passage incontournable lors de votre visite. Profitez de son atmosphère unique et de sa vue imprenable sur la mer Méditerranée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1281cfa1-96ad-4bf1-8755-b9fd53f22071", "translation" => "مع معمارها الذي يجمع بين الحداثة والتقاليد الجزائرية، هذا الميناء الغني بالتاريخ هو مرور لا غنى عنه أثناء زيارتك. استمتع بأجوائه الفريدة وإطلالته الرائعة على البحر الأبيض المتوسط.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1340
            ["id" => "01bc9e95-877b-450f-9628-a65a5e90d00d", "translation" => "The monument is a solemn representation of the national emblem, with statues of mujahidin from the National liberation army dressed differently and proudly carrying the Algerian flag, a symbol of victory and sovereignty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8df0fdff-4203-40c3-b5da-d95c9d1fd3d7", "translation" => "Le monument est une représentation solennelle de l'emblème national, avec des statues de moudjahidine de l'Armée de libération nationale habillés différemment et portant fièrement le drapeau algérien, symbole de victoire et de souveraineté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c9a3ca71-b862-4dd6-b9b4-bb24a7394d46", "translation" => "هذا المعلم هو تمثيل جلي للشعار الوطني، مع تماثيل لمجاهدين من جيش التحرير الوطني يرتدون ملابس مختلفة ويحملون بفخر العلم الجزائري، رمزاً للنصر والسيادة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1341
            ["id" => "ecf3086b-5fce-459a-ac3e-324eedd1b76a", "translation" => "Don't miss the opportunity to have unforgettable moments at the Azur beach, a true coastal gem near Algiers. Come and enjoy the sun, the sea, and the warm atmosphere that awaits you.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "87eef2b5-4714-4ecf-b36e-2adf6622ef6e", "translation" => "Ne manquez pas l'occasion de passer des moments inoubliables à la Plage Azur, un véritable joyau balnéaire à proximité d'Alger. Venez profiter du soleil, de la mer et de l'atmosphère chaleureuse qui vous attendent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "24d7205a-52c1-4aff-97c2-0e7f96661803", "translation" => "لا تفوت فرصة قضاء لحظات لا تُنسى في الشاطئ الأزرق, وهو جوهرة ساحلية حقيقية بالقرب من الجزائر العاصمة. تعال واستمتع بالشمس والبحر والجو الدافئ الذي ينتظرك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1342
            ["id" => "c1d59c53-20bf-4bde-ad80-1aeb39523416", "translation" => "The Golden sand beach is much more than just a beach; it is a true haven of beauty, tranquility, and safety. Get ready to experience magical moments on the glistening shores of this beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5a452b65-0bd2-45a8-b7e2-e772eedaa863", "translation" => "La plage des Sables d'Or est bien plus qu'une simple plage, c'est un véritable refuge de beauté, de tranquillité et de sécurité. Préparez-vous à vivre des moments magiques sur les rives scintillantes de cette plage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f3e2aec0-a21f-4224-9e8a-6bbe6141ff8b", "translation" => "شاطئ الرمال الذهبية هي أكثر من مجرد شاطئ؛ إنها ملاذ حقيقي للجمال والهدوء والأمان. قدّم نفسك لتجربة لحظات سحرية على هذا الشاطئ اللامع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1343
            ["id" => "a0a8bdbd-427f-4f7f-9cf0-858764f4bb34", "translation" => "This beach provides you with a spacious area to enjoy swimming and sunbathing. It harmoniously combines fine to coarse sand with scattered pebbles, adding a touch of diversity to this enchanting landscape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c79ce8dd-9d53-4a96-9011-5937980fba66", "translation" => "Cette plage vous offre un espace spacieux pour profiter de la baignade et du soleil. Elle combine harmonieusement du sable fin à grossier ainsi que des galets épars, ajoutant une touche de diversité à ce paysage enchanteur.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7ee3a8e4-5771-41b9-8783-73c2384c6814", "translation" => "هذا الشاطئ يوفر لك مساحة واسعة للاستمتاع بالسباحة والتشمس. إنه يجمع بين الرمال الناعمة والخشنة بانسجام بالإضافة إلى حصى متناثرة، مما يضيف لمسة من التنوع لهذا المشهد الساحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1344
            ["id" => "07d26af1-5c13-4e70-88d9-39aaacb3f75a", "translation" => "The Beldi Pool features a stunning and well-maintained swimming pool, as well as impeccably clean restroom facilities and changing rooms. You can relax on the sun loungers facing the sea and enjoy a breathtaking view.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ee37198e-e5ba-4986-8812-7088652d2818", "translation" => "Le Beldi Pool dispose d'une superbe piscine, parfaitement entretenue, ainsi que de sanitaires et de cabines d'une propreté exemplaire. Vous pourrez vous relaxer sur les transats face à la mer, et profiter d'une vue imprenable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c6acab9f-9086-4507-a2da-bd64c9d82e34", "translation" => "مسبح بلدي يتميز بمسبح رائع ومحافظ عليه بشكل مثالي، بالإضافة إلى مرافق صحية وغرف تغيير نظيفة. يمكنك الاسترخاء على كراسي مُوجَّهة نحو البحر والاستمتاع بإطلالة خلّابة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1345
            ["id" => "3940a327-93ac-468d-bbd3-5be38dc85a83", "translation" => "Whether it's a school trip, a family visit, or a group outing, the Algiers educational farm offers a memorable and enriching experience for everyone. Come and discover this unique place where learning takes place through direct interaction with farm animals in a safe and age-appropriate environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "89793568-ec37-4d60-98d3-e108ddcfbe34", "translation" => "Que ce soit dans le cadre d'une sortie scolaire, d'une visite en famille ou d'un groupe, la Ferme Pédagogique d'Alger offre une expérience mémorable et enrichissante pour tous. Venez découvrir ce lieu unique où l'apprentissage se fait au contact direct des animaux de la ferme, dans un environnement sécurisé et adapté à tous les âges.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ecb16a98-5309-48b2-b9cc-9b9239ba2862", "translation" => "سواء كان ذلك في إطار رحلة مدرسية أو زيارة عائلية أو رحلة جماعية، تقدم مزرعة الجزائر التعليمية تجربة لا تُنسى ومثرية للجميع. تعال واكتشف هذا المكان الفريد حيث يتم التعلم من خلال التفاعل المباشر مع حيوانات المزرعة في بيئة آمنة ومناسبة لجميع الأعمار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1346
            ["id" => "dfba4092-96fc-4353-9081-4a541350520c", "translation" => "Welcome to Zeralda Park, a place specially designed for the happiness of children. The park offers a multitude of playful and entertaining attractions that will delight the youngest ones.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5a4169c6-14f1-4c04-8735-2b8b6fc0fd3e", "translation" => "Bienvenue au Zeralda Parc, un lieu spécialement conçu pour le bonheur des enfants. Le parc propose une multitude d'attractions ludiques et divertissantes qui raviront les plus jeunes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f685238c-d288-49bc-a777-e76bd1d821ae", "translation" => "مرحبًا بكم في زرالدة بارك, مكان مصمم خصيصًا لسعادة الأطفال. تقدم الحديقة مجموعة متنوعة من الألعاب والمعالم الترفيهية التي ستسعد الأصغر سنًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1347
            ["id" => "4a056436-4707-4767-b427-63098f232aaf", "translation" => "The proximity of the small square to other attractions and amenities, such as restaurants and shops, makes it a prime location to gather and enjoy the lively atmosphere of Zeralda.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9da489a0-0c5e-499e-80d9-9e6511ab337b", "translation" => "La proximité de la placette avec d'autres attractions et commodités, telles que des restaurants et des boutiques en fait un lieu de choix pour se retrouver et profiter de l'ambiance animée de Zeralda.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8086ddda-5222-46d2-9480-ec0a78342ff7", "translation" => "قرب الساحة الصغيرة من معالم أخرى ووسائل الراحة، مثل المطاعم والمحلات، يجعلها مكانًا رئيسيًا للتجمع والاستمتاع بالأجواء الحية في زرالدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1348
            ["id" => "31b66c69-eeec-4fff-a687-385da1bc5742", "translation" => "This charming public garden is the perfect place to relax after a long walk. Spacious enough to accommodate many visitors, it provides several benches for comfortable resting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "556f168e-2260-4732-9f5b-f6b42943b5d2", "translation" => "Ce charmant jardin public est l'endroit parfait pour se détendre après une longue promenade. Suffisamment spacieux pour accueillir de nombreux visiteurs, il offre plusieurs bancs pour se reposer confortablement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a825d707-3e84-41b6-989e-019c0ab39273", "translation" => "هذه الحديقة العامة الساحرة هي المكان المثالي للاسترخاء بعد مشي طويل. فهي واسعة بما يكفي لاستقبال العديد من الزوار، وتوفر العديد من المقاعد للراحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1349
            ["id" => "2b76dd21-3c75-482e-bac1-425a8dd0da2b", "translation" => "The Resistance square is a place that honors the heroes and values of the nation. Come and immerse yourself in the spirit of resistance and determination that have shaped the history of Algeria.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1c9c5b37-db0b-4b1e-9217-a3597aeba6b4", "translation" => "La place de la Résistance est un lieu qui honore les héros et les valeurs de la nation. Venez vous imprégner de l'esprit de résistance et de la détermination qui ont façonné l'histoire de l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0286abf6-c145-4575-b09c-058fb2c62d99", "translation" => "ساحة المقاومة هي مكان يكرم الأبطال والقيم الوطنية. تعالوا وانغمسوا في روح المقاومة والعزم الذي شكلا تاريخ الجزائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1350
            ["id" => "7ece69d3-fe0a-43c7-b02b-aae9c919557b", "translation" => "The Olympic museum of Algeria is a place that preserves the memory of the national sport while being a dynamic cultural center. By visiting this museum, you will delve into the history of Algerian sports and discover the significance of this heritage for the country.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "42b88687-d030-4abd-b946-7394f85279b1", "translation" => "Le Musée olympique d'Algérie est un lieu qui préserve la mémoire du sport national tout en étant un centre culturel dynamique. En visitant ce musée, vous plongerez dans l'histoire du sport algérien et découvrirez l'importance de cet héritage pour le pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d4c2f1c5-b43f-4e10-b25f-7a3e6861afc4", "translation" => "المتحف الأولمبي في الجزائر هو مكان يحتفظ بذاكرة الرياضة الوطنية وفي الوقت نفسه يعتبر مركزًا ثقافيًا نشطًا. عند زيارة هذا المتحف، ستغمر نفسك في تاريخ الرياضة الجزائرية وستكتشف أهمية هذا التراث للبلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1351
            ["id" => "fc008159-bd22-4cc3-ba29-287267378c0f", "translation" => "The Sierra Maestra cinema has become an essential venue for hosting various performances, especially for children and young enthusiasts of lively rhythms.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "71c2242d-4709-4a83-b0e7-2ae8ed4554c5", "translation" => "Le cinéma Sierra Maestra est devenu un lieu incontournable pour l’organisation de divers spectacles, en particulier destinés aux enfants et aux jeunes passionnés de rythmes enflammés.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0ece2c9c-a727-471c-89e7-c2fe08d1ba2b", "translation" => "سينما سييرا مايسترا أصبحت مكانًا أساسيًا لاستضافة مختلف العروض الفنية، وخاصة تلك التي تستهدف الأطفال والشبان المشوقين بالإيقاعات الملتهبة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1352
            ["id" => "98001afd-0588-4399-8b52-b6b332d2d717", "translation" => "Come and admire the al Rahma mosque and discover its architectural beauty, serene atmosphere, and cultural and religious significance. It is a place of peace and spirituality where the faithful can contemplate and find a sense of connection with the divine.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "12d16d02-7f2c-470e-ab0c-f9033da4c992", "translation" => "Venez admirer la mosquée el Rahma et découvrez sa beauté architecturale, son atmosphère sereine et son importance culturelle et religieuse. C'est un lieu de paix et de spiritualité où les fidèles peuvent se recueillir et trouver un sentiment de connexion avec le divin.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7f42841e-d5ef-4703-a32f-036c89c96677", "translation" => "تعال وتعجب بجمال مسجد الرحمة واكتشف جماليته المعمارية، وجوهره الهادئ، وأهميته الثقافية والدينية. إنه مكان للسلام والروحانية حيث يمكن للمؤمنين أن يتأملوا ويجدوا شعورًا بالاتصال مع الإله.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1353
            ["id" => "d4752786-863c-4dfb-bc44-a9ec81ba89c5", "translation" => "Inside the craft House, you will discover several workshop boutiques dedicated to specific artisanal crafts. These workshops showcase traditional skills such as ceramics, painting, copperware, embroidery, traditional sewing, leatherwork, and glassblowing.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "831603ca-6030-41af-b5d4-a0c8b5a90417", "translation" => "À l'intérieur de la maison de l'artisanat, vous découvrirez plusieurs ateliers-boutiques dédiés à des métiers artisanaux spécifiques. Ces ateliers mettent en valeur des savoir-faire traditionnels tels que la céramique, la peinture, la dinanderie (travail du cuivre), la broderie, la couture traditionnelle, la maroquinerie et la verrerie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0714b518-5672-4876-b2c1-0413f1c0a39c", "translation" => "داخل دار الصناعة التقليدية, ستكتشف العديد من ورش العمل والمتاجر المخصصة لحرف يدوية معينة. تلك الورش تبرز مهارات تقليدية مثل صناعة الخزف، والرسم، وصناعة النحاس، والتطريز، والخياطة التقليدية، وصناعة الجلود، وصناعة الزجاج.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1354
            ["id" => "3bfede96-325b-4ff5-8776-8c677c4d45fd", "translation" => "Whether you're an art connoisseur or simply curious to explore new artistic expressions, the Medina Mood Concept Store & Gallery invites you to immerse yourself in the creative world of art and craftsmanship.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "01907882-b97a-4ec4-8196-d49f4f787166", "translation" => "Que vous soyez un connaisseur d'art ou simplement curieux de découvrir de nouvelles expressions artistiques, le Medina Mood Concept Store & Gallery vous invite à plonger dans l'univers créatif de l'art et de l'artisanat.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e2e02ce4-9d45-417b-ade1-f7b0f41fe151", "translation" => "سواء كنت متذوقًا للفن أو مجرد فضولي لاكتشاف تعابير فنية جديدة، يدعوك هذا المعرض الفني إلى أن تغمر نفسك في عالم الإبداع للفن والحرف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1355
            ["id" => "83450ade-5fba-475b-83aa-feb724f7596a", "translation" => "The art and craftsmanship shop of the Art Kezas Gallery is a true paradise for art enthusiasts and collectors. You can find unique pieces there, created with passion and craftsmanship.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1a9b9730-b7fd-4d9c-808c-cb90e2811c53", "translation" => "La boutique d'art et d'artisanat de l’Art Kezas Galerie est un véritable paradis pour les amateurs d'art et les collectionneurs. Vous pourrez y trouver des pièces uniques, créées avec passion et savoir-faire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "18c301e5-17e4-423d-871e-0addde2a331d", "translation" => "متجر الفن والحرف التقليدية في هذا المعرض الفني هو جنة حقيقية لعشاق الفن والمجمعين. يمكنك أن تجد هنا قطع فريدة من نوعها، تم إنشاؤها بشغف ومهارة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1356
            ["id" => "6afd4f00-6f9f-4916-809a-653f60ed8f40", "translation" => "Whether you're looking for a recreational spot for children, a family outing, or simply a peaceful place to relax, the Val d'Hydra garden is the perfect destination.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f475371b-c9aa-4e43-9a06-463e99f60a65", "translation" => "Que vous soyez en quête d'un lieu de loisirs pour les enfants, d'une sortie en famille ou simplement d'un endroit paisible pour vous détendre, le jardin du Val d'Hydra est l'endroit idéal.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ff468af8-2989-43c6-bf1d-a020311f30e0", "translation" => "سواء كنتم تبحثون عن مكان ترفيهي للأطفال، أو نزهة عائلية، أو مجرد مكان هادئ للاسترخاء، حديقة حيدرة هي المكان المثالي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1357
            ["id" => "03cdf022-0879-49ca-b712-e273fccbaadb", "translation" => "Ksar Skala is a true architectural gem, bearing witness to the Ottoman era and the rich history of Algiers. However, it's important to note that the palace is currently in an advanced state of decay.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d2d5c77c-aec0-442a-853f-7f0270d39494", "translation" => "Le Ksar Skala est un véritable joyau architectural, témoignant de l'ère ottomane et de l'histoire riche d’Alger. Cependant, il est important de noter que le palais se trouve actuellement dans un état avancé de délabrement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4772fd92-af7b-4c30-884d-661ca0f173e2", "translation" => "قصر السكالة هو جوهرة معمارية حقيقية، تشهد على عصر الدولة العثمانية وتاريخ الجزائر الغني. ومع ذلك، من المهم أن نلاحظ أن القصر يعاني حالياً من حالة متقدمة من التدهور.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1358
            ["id" => "cc6b8889-f574-4d8d-b0a8-a66d2e2d1f30", "translation" => "The cultural center of El Biar is a unique place located in the heart of the city. Once a Catholic church, it has been renovated and transformed into a space dedicated to culture. Despite its transformation, some original stained glass windows have been preserved, including the magnificent stained glass windows of St. Pierre and Paul, which are worth a visit.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "26f6cebe-0827-4ce8-98c2-c65feee20bb4", "translation" => "Le centre culturel d'el Biar est un lieu unique situé au cœur de la ville. Autrefois une église catholique, il a été rénové et transformé en un espace dédié à la culture. Malgré sa transformation, quelques vitraux d'origine ont été préservés, notamment les magnifiques vitraux de St Pierre et Paul, qui valent le détour.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "33c58410-1ef0-44e0-a69d-aa1a5ec6c499", "translation" => "المركز الثقافي في البيار هو مكان فريد يقع في قلب المدينة. فيما كان سابقاً كنيسة كاثوليكية، تم تجديده وتحويله إلى مساحة مخصصة للثقافة. على الرغم من تحوله، تم الاحتفاظ ببعض النوافذ الملونة الأصلية، بما في ذلك نوافذ سانت بيير وسانت بول الرائعة، والتي تستحق الزيارة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1359
            ["id" => "0ff5931a-2b18-4e35-bbbd-780ffa07bdb4", "translation" => "Whether you're drawn to painting, sculpture, photography, or any other form of art, Bloom The Art Factory is a must-visit place in Algiers. Get ready to be amazed by the diversity and quality of the artworks on display, as well as the stimulating and friendly atmosphere that prevails there.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e5712faa-3879-42e3-a5ab-e97c686fdc67", "translation" => "Que vous soyez attiré par la peinture, la sculpture, la photographie ou toute autre forme d'art, le Bloom The Art Factory est un endroit incontournable à Alger. Préparez-vous à être émerveillé par la diversité et la qualité des œuvres présentées, ainsi que par l'atmosphère stimulante et conviviale qui y règne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6f2bb50e-db8a-4c8e-b631-ff52137dd05e", "translation" => "سواء كنت متجذّرًا في الرسم أو النحت أو التصوير أو أي شكل آخر من أشكال الفن، فإن المعرض الفني 'بلوم' هو مكان يجب زيارته في الجزائر. استعد للإعجاب بتنوع وجودة الأعمال الفنية المعروضة، بالإضافة إلى الجو المحفز والودي الذي يسود هناك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1360
            ["id" => "7ea39e76-2fab-42e4-8bdb-1bcd4ae20ed3", "translation" => "Whether it's for a leisurely stroll, a playtime for children, or simply to recharge in a green setting, the Revolution garden is a place where everyone can find a space to relax and enjoy a moment of calm amidst the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b4b2e8d7-e65d-4f3a-b52e-00acac812b54", "translation" => "Que ce soit pour une promenade tranquille, une séance de jeux pour les enfants ou simplement pour se ressourcer dans un cadre verdoyant, le jardin de la révolution est un lieu où chacun peut trouver un espace pour se détendre et profiter d'un moment de calme au milieu de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "97bb833d-c26b-41fd-8de7-06dca4312966", "translation" => "سواء كان ذلك لجولة هادئة أو جلسة لعب للأطفال أو ببساطة للتجديد في إطار خضراء، فحديقة الثورة هي مكان حيث يمكن للجميع أن يجد مساحة للاسترخاء والاستمتاع بلحظة هدوء في وسط المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1361
            ["id" => "3bb79687-70fd-4810-87a2-ebd93ba80291", "translation" => "The old church of Birkhadem is a historic building that bears witness to the religious heritage of the region. Although it is no longer used as a place of worship, it retains an imposing presence and undeniable charm.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "24b473d9-66ce-4063-a4ac-5bee676c1909", "translation" => "L'ancienne église de Birkhadem est un bâtiment historique qui témoigne du patrimoine religieux de la région. Bien qu'elle ne soit plus utilisée comme lieu de culte, elle garde une présence imposante et un charme indéniable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "311727c5-c135-4217-9bd6-0357d24d1aa1", "translation" => "كنيسة بئر خادم القديمة هي مبنى تاريخي يشهد على التراث الديني للمنطقة. على الرغم من أنها لم تعد تستخدم كمكان للعبادة، إلا أنها تحتفظ بوجود مهيب وجاذبية لا تُنكر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1362
            ["id" => "005cacc7-7b27-43df-bc94-ddde340d5643", "translation" => "The garden is a cherished place for residents and visitors, providing a peaceful and green atmosphere in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "39be31ea-5c81-43ea-bb68-060a6d0d7006", "translation" => "Le jardin est un lieu prisé des habitants et des visiteurs, offrant une atmosphère paisible et verdoyante au cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9f2071d3-e425-4d49-a3c5-ce08a1a73bd9", "translation" => "الحديقة هي مكان يحظى بشعبية كبيرة بين السكان والزوار، حيث توفر أجواء هادئة وخضراء في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1363
            ["id" => "d355fa83-11f7-4cca-9b70-7bc0a2ab2bfa", "translation" => "The tranquil ambiance of the garden makes it an ideal place to escape the hustle and bustle of urban life. Visitors can enjoy a moment of peace by reading a book or simply rejuvenating amidst the lush nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0b088124-2d67-4c8b-b906-c11106208b65", "translation" => "L'ambiance tranquille du jardin en fait un lieu idéal pour échapper au tumulte de la vie urbaine. Les visiteurs peuvent profiter d'un moment de calme en lisant un livre ou simplement en se ressourçant au milieu de la nature luxuriante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fc0be7b3-a6fc-4087-8f65-8da1380471af", "translation" => "الأجواء الهادئة في الحديقة تجعلها مكانًا مثاليًا للهروب من صخب الحياة الحضرية. يمكن للزوار الاستمتاع بلحظات من السكينة بقراءة كتاب أو ببساطة بالاستمتاع بالانتعاش في وسط الطبيعة الخضراء الجميلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1364
            ["id" => "15073f9a-3030-4328-be31-86a5decc78cc", "translation" => "Thanks to its regular maintenance, the small square is kept clean and welcoming, making it a pleasant place to spend time. Whether for a quick break during a busy day or for a more leisurely relaxation, the El Harrach small square provides a friendly and convenient setting in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a9a3f70f-c04b-4874-999f-da5785352b64", "translation" => "Grâce à son entretien régulier, la placette est maintenue propre et accueillante, ce qui en fait un lieu agréable pour passer du temps. Que ce soit pour faire une pause rapide lors d'une journée chargée ou pour se détendre plus longuement, la placette d'El Harrach offre un cadre convivial et pratique au cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "25a2a075-9321-459f-a673-d609b497cc84", "translation" => "بفضل الصيانة الدورية، يتم الحفاظ على نظافة وجاذبية الساحة الصغيرة، مما يجعلها مكانًا لطيفًا لقضاء الوقت. سواءً كان ذلك للاستراحة السريعة خلال يوم مزدحم أو للاسترخاء بشكل أطول، تقدم ساحة الحراش محيطًا ودودًا وملائمًا في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1365
            ["id" => "c9b568e1-09e9-4f6a-878d-7093c020a90b", "translation" => "Whether it's for reading a book, soaking up the sun, or simply rejuvenating, this park provides an ideal setting for relaxation. Sports enthusiasts will also find their happiness thanks to the available sports facilities, such as football, basketball, and tennis courts. The water spring park offers a perfect combination of entertainment, relaxation, and sports activities in a peaceful and serene environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fb9be542-d42e-4e76-81f5-9681c69d82bd", "translation" => "Que ce soit pour lire un livre, profiter du soleil ou simplement se ressourcer, ce parc offre un cadre propice à la détente. Les amateurs de sport trouveront également leur bonheur grâce aux équipements sportifs disponibles, tels que des terrains de football, de basket-ball et de tennis. Le parc de la Prise d'eau offre ainsi une combinaison parfaite de divertissement, de détente et d'activités sportives dans un environnement calme et serein.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "db46e2bf-e833-4e24-9f6a-dabac29f8fb4", "translation" => "سواء كان الأمر يتعلق بقراءة كتاب، أو الاستمتاع بأشعة الشمس، أو ببساطة التجديد، تقدم هذه الحديقة إعدادًا مثاليًا للاسترخاء. سيجد عشاق الرياضة أيضًا سعادتهم بفضل المرافق الرياضية المتاحة، مثل ملاعب كرة القدم وكرة السلة والتنس. حديقة منبع المياه هو تقديم مثالي للترفيه والاسترخاء والأنشطة الرياضية في بيئة هادئة ومطمئنة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1366
            ["id" => "0885f9b2-6024-4e3c-bd58-2b01230dee74", "translation" => "The Oued Smar urban park is a rehabilitation project of the former public landfill of the capital. Therefore, it is not only a recreational and relaxation space for families but also an example of ecological waste management and sustainable resource utilization.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "21ec7274-a99f-4a09-b277-cd89aca12b0c", "translation" => "Le parc urbain d'Oued Smar est un projet de réhabilitation de l’ancienne décharge publique de la capitale. Il est donc non seulement un espace de loisirs et de détente pour les familles, mais également un exemple de gestion écologique des déchets et d'utilisation durable des ressources.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6a7c8218-d920-461e-a36f-7f5c55ba009f", "translation" => "الحديقة الحضرية واد السمار هي مشروع لإعادة تأهيل موقع القمامة العام السابق للعاصمة. لذلك، إنها ليست مكانًا فقط للترفيه والاسترخاء للعائلات، ولكنها أيضًا مثال على إدارة النفايات البيئية واستخدام الموارد بطريقة مستدامة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1367
            ["id" => "677f06ca-3c8e-4723-8633-da54bbc79e8f", "translation" => "The November 1st garden is equipped with playgrounds for children, where they can have fun. This makes it an ideal place for families looking to spend time together in a pleasant setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2d88662e-21d2-4f38-aafc-d006041d37fc", "translation" => "Le jardin 1er Novembre est équipé d'aires de jeux pour les enfants, où ils peuvent s'amuser. Cela en fait un endroit idéal pour les familles qui cherchent à passer du temps ensemble dans un cadre agréable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6e46b1fd-5a17-414c-a3be-2842ebb55556", "translation" => "حديقة 1 نوفمبر مجهزة بمناطق لعب للأطفال حيث يمكنهم التسلية. وهذا يجعلها مكانًا مثاليًا للعائلات الباحثة عن قضاء وقت ممتع معًا في إطار لطيف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1368
            ["id" => "5346d063-89ef-47ee-9b31-e1f2586eafd9", "translation" => "The Baraki square garden is a charming, peaceful, and secure space, perfect for relaxation and spending quality time with children and friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "66311bff-7b3e-4205-bfe6-f2675c4dc713", "translation" => "Le jardin de la placette de Baraki est un charmant espace paisible et sécurisé, idéal pour se reposer et passer du temps agréable avec ses enfants et ses amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6700200e-5d7b-4eb4-816f-d19a49c29c52", "translation" => "حديقة ساحة براقي هي مكان ساحر هادئ وآمن، مثالي للراحة وقضاء وقت ممتع مع الأطفال والأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1369
            ["id" => "70fcb970-29d9-45ae-af06-fc9e3159819b", "translation" => "This garden provides a tranquil atmosphere, perfect for relaxation. Visitors can enjoy a moment of peace by sitting on the available benches or by grabbing a coffee in the vicinity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dceeafb4-6233-4968-a4ea-2c5cd311b076", "translation" => "Ce jardin offre une atmosphère tranquille, propice à la détente. Les visiteurs peuvent profiter d'un moment de calme en s'installant sur les bancs disponibles ou en prenant un café dans les environs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7778986e-0e59-4036-bbdf-f2c7c2fa1d5a", "translation" => "هذه الحديقة توفر أجواء هادئة، مثالية للاسترخاء. يمكن للزوار الاستمتاع بلحظة من الهدوء عند الجلوس على المقاعد المتاحة أو عند تناول كوب من القهوة .", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1370
            ["id" => "76d4e7b3-9c51-411d-80ae-c6d144037767", "translation" => "The Beaulieu forest is a beautiful and diverse natural space, offering a variety of activities for visitors, a gem where one can connect with nature while enjoying recreational facilities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4faabe06-387a-4b27-b0f8-4451f7a0ef7a", "translation" => "La forêt Beaulieu est un espace naturel magnifique et diversifié, offrant une variété d'activités pour les visiteurs, un joyau où l'on peut se connecter avec la nature tout en profitant d'installations récréatives.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5f3d4b6b-6e27-428b-8c10-5190f49fd09b", "translation" => "غابة بوليو هي مساحة طبيعية جميلة ومتنوعة، تقدم مجموعة متنوعة من الأنشطة للزوار، وهي جوهرة حيث يمكن للزوار التواصل مع الطبيعة والاستمتاع بالمرافق الترفيهية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1371
            ["id" => "b86e5968-7b5f-47e0-b07b-aefc01af2e13", "translation" => "The amusement park is a dynamic and friendly place, offering a variety of recreational activities for visitors of all backgrounds. Whether it's for playing, relaxing, or simply enjoying the lively atmosphere, this park is a must-visit entertainment destination in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "724ad4d0-643b-42b3-aa6e-bd961bae890c", "translation" => "Le parc de loisirs est un lieu dynamique et convivial, offrant une variété d'activités récréatives pour les visiteurs de tous horizons. Que ce soit pour jouer, se détendre ou simplement profiter de l'atmosphère enjouée, ce parc est un lieu de divertissement incontournable dans la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d614a778-1983-4da5-875d-bdc5058455bb", "translation" => "حديقة التسلية هي مكان حيوي وودود، حيث يتم تقديم مجموعة متنوعة من الأنشطة الترفيهية للزوار من جميع الأعمار. سواء كان الهدف اللعب أو الاسترخاء أو ببساطة الاستمتاع بالأجواء المريحة، فإن هذه الحديقة الترفيهية هي وجهة ترفيهية لا غنى عنها في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1372
            ["id" => "6c303400-d5ac-4c20-afcf-a31d5ded35f4", "translation" => "The Annassers swimming pool is a pleasant place to cool off and relax, offering an enjoyable swimming experience in a safe and well-maintained environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "45321cd6-b39f-4a89-a384-bfbc9dadcd28", "translation" => "La piscine des Annassers est un lieu agréable pour se rafraîchir et se détendre, offrant une expérience de natation plaisante dans un cadre sûr et bien entretenu.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "87cf5ac3-bc2d-4f25-a471-ea3aeb017bc8", "translation" => "مسبح العناصر هو مكان لطيف للتبريد والاسترخاء، حيث يقدم تجربة سباحة ممتعة في بيئة آمنة ومُعتنى بها بشكل جيد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1373
            ["id" => "91f073b9-74ae-4199-8ba3-a38637b53960", "translation" => "The Ben Omar garden is a green and soothing space, providing a tranquil retreat amidst the hustle and bustle of urban life. It's a place where visitors can connect with nature, relax, and enjoy a moment of peace and serenity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "806cb042-6971-4b5e-96ab-f3ce528e3c99", "translation" => "Le jardin Ben Omar est un espace verdoyant et apaisant, offrant une retraite tranquille au milieu de l'agitation de la vie urbaine. C'est un lieu où les visiteurs peuvent se connecter avec la nature, se détendre et profiter d'un moment de calme et de sérénité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "724029cd-9a43-48d2-af8c-026d4c6a1651", "translation" => "حديقة بن عمر هي مساحة خضراء هادئة، تقدم مأوى هادئًا وسط صخب الحياة الحضرية. إنها مكان يمكن للزوار فيه التواصل مع الطبيعة والاسترخاء والاستمتاع بلحظة من السكينة والهدوء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1374
            ["id" => "1634c29e-0279-4653-b1c8-2dac25213cdf", "translation" => "The Diar El Afia forest is a valuable place, offering a unique combination of recreational activities, green spaces, and a preserved natural environment. It is cherished by the local residents who enjoy its many benefits in terms of relaxation, entertainment, and well-being.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "329ccc69-8508-4c9a-b1fb-1124fede854d", "translation" => "La forêt Diar El Afia est un lieu précieux, offrant une combinaison unique d'activités récréatives, d'espaces verts et d'un environnement naturel préservé. Elle est appréciée par les habitants de la région qui bénéficient de ses multiples avantages en termes de détente, de divertissement et de bien-être.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a0ab28a4-3972-4846-8061-234d200e06c7", "translation" => "غابة ديار العافية هي مكان قيم، تقدم مزيجًا فريدًا من الأنشطة الترفيهية والمساحات الخضراء والبيئة الطبيعية المحفوظة. إنها تُقدر من قبل سكان المنطقة الذين يستفيدون من فوائدها المتعددة فيما يتعلق بالاسترخاء والترفيه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1375
            ["id" => "aa754178-e68f-4e47-8c0e-3e41181c4f2a", "translation" => "The Boubsila park is a versatile place that combines entertainment, sports, and relaxation. With its playgrounds for children, open-air theater, football field, and tennis court, it offers a multitude of activities to cater to the diverse interests of visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7b7a2859-a2a2-4cfe-a7b6-6dd97f695492", "translation" => "Le parc Boubsila est un lieu polyvalent qui allie divertissement, sport et détente. Avec ses aires de jeux pour enfants, son théâtre en plein air, son terrain de football et son court de tennis, il offre une multitude d'activités pour répondre aux différents intérêts des visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c16350c3-f033-4b79-a306-1faa77c59850", "translation" => "حديقة بوبصيلة هي مكان متعدد الاستخدامات يجمع بين الترفيه والرياضة والاسترخاء. بفضل مساحاتها للعب الأطفال، ومسرحها في الهواء الطلق، وملعبها لكرة القدم، وملعب التنس، تقدم مجموعة متنوعة من الأنشطة لتلبية اهتمامات الزوار المختلفة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1376
            ["id" => "95a555af-4a99-4b0d-959f-60dfe17435f2", "translation" => "The Jozip Tito park is a friendly and family-oriented place, offering a range of activities for all tastes. Whether it's for sports, entertainment on children's attractions, enjoying the pool, or dining, visitors can have an enjoyable time in this welcoming park.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "de4d5885-eba0-4756-ae12-f23aa068a4ac", "translation" => "Le parc Jozip Tito est un lieu convivial et familial, offrant une gamme d'activités pour tous les goûts. Que ce soit pour faire du sport, se divertir sur les attractions pour enfants, profiter de la piscine ou se restaurer, les visiteurs peuvent passer un moment agréable dans ce parc accueillant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "eaea45c4-ddb5-431c-af0a-cf6e10f0733d", "translation" => "حديقة جوزيب تيتو هي مكان ودود وموجه للعائلات، حيث تقدم مجموعة متنوعة من الأنشطة لجميع الأذواق. سواء كان الأمر يتعلق بممارسة الرياضة، أو التسلية على ألعاب الأطفال، أو الاستمتاع بالمسبح، أو تناول الطعام، يمكن للزوار قضاء وقت ممتع في هذه الحديقة الودودة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1377
            ["id" => "a55d5bca-5802-4897-bf27-5583e506090a", "translation" => "The Ben Aknoun forest is a versatile wooded area offering a perfect combination of relaxation, sports activities, and family outings. Whether it's for rejuvenation, physical activity, or simply reconnecting with nature, this forest is a cherished destination to escape the fast pace of urban life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b83cb910-410d-438c-bece-c78f400d836b", "translation" => "La forêt de Ben Aknoun est un espace boisé polyvalent offrant une combinaison parfaite de détente, d'activités sportives et de promenades familiales. Que ce soit pour se ressourcer, se dépenser ou simplement se reconnecter avec la nature, cette forêt est une destination appréciée pour échapper au rythme effréné de la vie urbaine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4bed7b43-bf16-4357-a50f-5ad05a406a90", "translation" => "غابة بن عكنون هي منطقة متعددة الاستخدامات تقدم مزيجًا مثاليًا من الاسترخاء وأنشطة رياضية ورحلات عائلية. سواء كان الهدف ممارسة النشاط البدني، أو ببساطة إعادة الاتصال بالطبيعة، فإن هذه الغابة هي وجهة محبوبة للهروب من إيقاع الحياة الحضرية السريع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1378
            ["id" => "2422aced-d7a4-4784-a393-ba6f33305726", "translation" => "The Soekarno monument is a testament to the historical significance and strong ties between Algeria and Indonesia. It serves as a reminder of Soekarno's significant contribution to the independence of his country and a symbol of friendship between the two nations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "27e8f979-dee1-4e62-a3ac-2d7afeab9c51", "translation" => "Le monument Soekarno est un témoignage de l'importance historique et des liens forts entre l'Algérie et l'Indonésie. Il est un rappel de la contribution significative de Soekarno à l'indépendance de son pays et un symbole de l'amitié entre les deux nations.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7158fbe4-bc76-47c3-ad06-05192d9a8b53", "translation" => "نصب سوكارنو هو شاهد على أهمية تاريخية وعلاقات قوية بين الجزائر وإندونيسيا. إنه تذكير بالمساهمة الكبيرة لسوكارنو في استقلال بلاده ورمز للصداقة بين الدولتين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1379
            ["id" => "06c7b241-dc0e-4b24-bbcf-60a739953caf", "translation" => "Meltin'Art is a creative space that offers a variety of artistic activities for children, teenagers, and adults. This dynamic place allows participants to engage in different forms of artistic expression.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6d4a9ba9-8188-4da3-b77d-510504f809db", "translation" => "Meltin'Art est un espace créatif qui propose une variété d'activités artistiques pour les enfants, les adolescents et les adultes. Cet endroit dynamique permet aux participants de s'engager dans différentes formes d'expression artistique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2993fa90-d935-48e3-82e1-dafe2e8e5e4c", "translation" => "هذا المعرض الفني مساحة إبداعية تقدم مجموعة متنوعة من الأنشطة الفنية للأطفال والمراهقين والبالغين. هذا المكان الدينامي يتيح للمشاركين الاشتراك في مختلف أشكال التعبير الفني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1380
            ["id" => "3cde807a-666b-49ba-a869-56a3fdf0277b", "translation" => "The dome is a versatile and prestigious venue that hosts a variety of events, from sports events to concerts and other cultural gatherings. Its substantial capacity and unique architecture make it a memorable venue for both audiences and performers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4ca92b38-f21e-4795-b192-c953f66f5376", "translation" => "La Coupole est une salle polyvalente et prestigieuse qui accueille une variété d'événements, des manifestations sportives aux concerts en passant par d'autres événements culturels. Sa capacité importante et son architecture unique en font un lieu mémorable pour les spectateurs et les artistes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d5bc2e58-d5ef-4419-b289-9ebcf8288e33", "translation" => "القاعة البيضاوية مكان متعدد الاستخدامات وراقي يستضيف مجموعة متنوعة من الأحداث، بدءًا من الفعاليات الرياضية وصولاً إلى الحفلات الموسيقية والفعاليات الثقافية الأخرى. طاقته الكبيرة وهندسته المعمارية الفريدة تجعله مكانًا لا يُنسى للجماهير والفنانين على حد سواء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1381
            ["id" => "9e9e0088-96b6-49a4-8319-76b4d15e7049", "translation" => "The Carob forest is a pleasant natural space in the midst of the city. With its family-friendly areas, tranquility, children's playgrounds, and sports facilities, it provides a comprehensive experience for all visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "954548b1-2d1b-4fd8-94aa-9a69832a2472", "translation" => "La forêt du Caroubier est un espace naturel agréable au milieu de la ville. Avec ses coins familiaux, son calme, ses aires de jeux pour enfants et ses installations sportives, elle offre une expérience complète pour tous les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0fea4c12-65fe-4ed1-ad75-ec581d16dc36", "translation" => "غابة الخروب هي مساحة طبيعية لطيفة في قلب المدينة. بفضل مناطقها العائلية وهدوئها ومناطق اللعب للأطفال والمرافق الرياضية، تقدم تجربة شاملة لجميع الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1382
            ["id" => "4e03cd6a-7059-41ee-a798-dd2b70f421f9", "translation" => "The Seen Art Gallery is a prominent art gallery and exhibition space in Algiers. It showcases original works by contemporary artists with a focus on the selection and quality of the exhibited art pieces. It is a cherished place for art enthusiasts and a must-visit destination to discover the local art scene.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d7c0099b-1a08-495c-887e-89e5a4f9a256", "translation" => "La Seen Art Gallery est une grande galerie d'art et un espace d'exposition de premier plan à Alger. Elle présente des œuvres originales d'artistes contemporains avec une attention particulière portée à la sélection et à la qualité des œuvres exposées. C'est un lieu apprécié par les amateurs d'art et une destination incontournable pour découvrir la scène artistique locale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1215e5bc-2a9d-4912-a74c-cdc3b771372b", "translation" => "هذا المعرض الفني مكان عرض رائد في الجزائر. يعرض أعمالًا أصلية لفنانين معاصرين مع التركيز على اختيار وجودة الأعمال المعروضة. إنه مكان محبب لعشاق الفن ووجهة لا غنى عنها لاكتشاف الساحة الفنية المحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1383
            ["id" => "4ea40555-4037-4b6d-82aa-530e18fd5e7f", "translation" => "The Dely Ibrahim golf field provides an ideal setting for golf enthusiasts, tennis aficionados, and those seeking a relaxing outdoor experience in nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ba067209-227d-4333-b98a-63713ed35438", "translation" => "Le terrain de golf de Dely Ibrahim offre un cadre idéal pour les passionnés de golf, les amateurs de tennis et les personnes à la recherche d'une expérience relaxante en pleine nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "81fe5c8d-b303-4a08-9fd5-95f6f93d895b", "translation" => "ملعب الجولف في دالي إبراهيم يقدم إعدادًا مثاليًا لعشاق الجولف وعشاق التنس وأولئك الذين يبحثون عن تجربة مريحة في الهواء الطلق في الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1384
            ["id" => "267d6aaf-406d-49a1-b1e1-001b0f213f01", "translation" => "This public garden is a recreational and entertainment space tailored to children. It provides a fun and stimulating experience for young visitors and creates a welcoming environment for families looking to enjoy the outdoors and spend time together.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "25e6b5e5-6de4-4895-a224-4f05d295376f", "translation" => "Ce jardin public est un espace de loisirs et de divertissement adapté aux enfants. Il offre une expérience amusante et stimulante pour les jeunes visiteurs et crée un cadre convivial pour les familles qui souhaitent profiter du plein air et passer du temps ensemble.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "40a5b650-7669-41ab-9958-90f68c292bad", "translation" => "هذه الحديقة العامة هي مساحة ترفيهية وتسلية مصممة خصيصًا للأطفال. إنها توفر تجربة ممتعة ومحفزة للزوار الصغار وتخلق بيئة ترحيبية للعائلات الراغبة في الاستمتاع بالهواء الطلق وقضاء وقت ممتع معًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1385
            ["id" => "0c22a51f-aa3e-44cf-918a-185c1277943d", "translation" => "This aqueduct represents the last structure of its kind built by the Ottomans in Algiers. While the aqueduct section is currently located on private property, its recognition as a national heritage and its restoration testify to its importance for preservation for future generations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0bcef899-3163-472e-9b5b-50c84ddb6aae", "translation" => "Cet aqueduc représente le dernier ouvrage de ce type réalisé par les Ottomans à Alger. Bien que le tronçon de l'aqueduc soit actuellement situé dans une propriété privée, sa reconnaissance en tant que patrimoine national et sa restauration témoignent de l'importance accordée à sa préservation pour les générations futures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b294d7b7-3e4c-4d2a-92ea-00dfeb98e5d2", "translation" => "هذا القناة المائية تمثل آخر منشأة من هذا النوع التي أنشأها العثمانيون في الجزائر. على الرغم من أن القسم الحالي من القناة موجود في ملكية خاصة، إلا أن اعترافها كتراث وطني وجهود ترميمها يشهدان على أهميتها للحفاظ عليها للأجيال القادمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1386
            ["id" => "a160c41e-517b-4a0b-982c-a4a23a4c2746", "translation" => "The Doudou Mokhtar garden is an appealing place to relax and spend time with friends or family. While there may be some maintenance gaps, its peaceful and friendly atmosphere still makes it a popular choice for unwinding and enjoying nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c092c25b-908d-4f77-ab42-9ae7c5a5e83b", "translation" => "Le jardin Doudou Mokhtar est un lieu attrayant pour se détendre et passer du temps avec des amis ou en famille. Bien qu'il puisse y avoir des lacunes dans son entretien, l'atmosphère calme et conviviale en fait toujours un choix apprécié pour se relaxer et profiter de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d3e795ee-3b75-4c84-9038-e0d2da778d4f", "translation" => "حديقة دودو مختار هي مكان جذاب للاسترخاء وقضاء وقت مع الأصدقاء أو العائلة. على الرغم من وجود بعض النقائص في الصيانة، إلا أن الأجواء الهادئة والودية تجعلها لا تزال خيارًا شائعًا للاسترخاء والاستمتاع بالطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1387
            ["id" => "f4d2f883-1c6a-448c-9881-a9cb6a1c66dd", "translation" => "The Olof Palme garden is a lovely place to relax and enjoy the beauty of nature. It's a space appreciated by children for play and by visitors of all ages for rejuvenation and connecting with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "63ddcbd9-9308-4fcf-8268-130c08ba8a22", "translation" => "Le jardin Olof Palme est un endroit charmant pour se détendre et profiter de la beauté de la nature. C'est un espace apprécié par les enfants pour jouer et par les visiteurs de tous âges pour se ressourcer et se connecter avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d8e8d2ac-99d8-4b07-bab0-4e7069ef4a92", "translation" => "حديقة أولف بالم هي مكان جميل للاسترخاء والاستمتاع بجمال الطبيعة. إنها مساحة محببة للأطفال للعب وللزوار من جميع الأعمار للاسترخاء والتواصل مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1388
            ["id" => "390504b7-7a58-41db-a333-c03c6f3264cf", "translation" => "The O'Pirate Aquapark is an appealing water park with fun activities for both kids and adults. Special offers and entertainment options enhance the park's appeal.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d44718de-a305-444f-9737-a0cfdbfd359b", "translation" => "Le O'Pirate Aquapark est un parc aquatique attrayant avec des activités amusantes pour les petits et les grands. Les offres spéciales et les animations ajoutent à l'attrait du parc.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e57e951e-99c6-4ae4-a3f6-b0058cd95a6a", "translation" => "مسبح اكوا بارك هو منتزه مائي جذاب مع أنشطة ممتعة للصغار والكبار على حد سواء. تُضيف العروض الخاصة والأنشطة الترفيهية إلى جاذبية المنتزه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1389
            ["id" => "66aaddd6-2180-4ff6-b2c0-4602f7a7541a", "translation" => "The Benmered 2 forest was once appreciated for its natural beauty, but it is currently awaiting rehabilitation to regain its glory and become a cherished relaxation and recreation space for the local residents.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "28d9cc18-de77-462d-abdc-47a1b6771c4a", "translation" => "Le jardin Benmered 2 est un lieu apprécié autrefois pour sa beauté naturelle, mais actuellement en attente de réhabilitation pour retrouver son éclat et redevenir un espace de détente et de loisirs apprécié des habitants de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "18e3f64b-33f3-4778-a8f9-08c7a6dc2ced", "translation" => "غابة بن مراد 2 كانت في السابق محبوبة بسبب جمالها الطبيعي، لكنها حاليًا في انتظار إعادة تأهيل لاستعادة سحرها وأن تصبح مكانًا محببًا للاسترخاء والترفيه لسكان المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1390
            ["id" => "2cf4efbd-a498-442a-aa18-f2ce291071d6", "translation" => "The local swimming pool is designed to provide aquatic leisure services to individuals who choose to subscribe to a periodic membership.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2158742c-2bf4-4b6f-a389-c4ba9cc9559d", "translation" => "La piscine de proximité est conçue pour offrir des services de loisirs aquatiques aux personnes qui choisissent de s'inscrire à un abonnement périodique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9e62932d-a620-4176-8e84-183d7526f6ec", "translation" => "المسبح المحلي مصمم لتقديم خدمات ترفيهية مائية للأشخاص الذين يختارون الاشتراك بشكل دوري.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1391
            ["id" => "c6a5748b-2adf-4712-93fc-ab67e0daa501", "translation" => "This garden is a place where nature and urban life blend, providing a space to relax and enjoy the outdoors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ac59c8df-f126-44d3-b927-515de419134f", "translation" => "Ce jardin est un endroit où la nature et la vie urbaine se mêlent, offrant un espace pour se détendre et profiter du plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "831b8866-3e6b-4f03-8b7a-aa2c8b71f203", "translation" => "هذه الحديقة هي مكان حيث تتداخل الطبيعة والحياة الحضرية، مما يوفر مساحة للراحة والاستمتاع بالهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1392
            ["id" => "b6ec56d3-b2d5-47ed-abdb-9387e158f418", "translation" => "Whether you want to spend a relaxing day with your family, enjoy sports activities, or simply cool off at the water park, the Sidi Abdellah sports and leisure park is the perfect place for an entertaining getaway.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f303ebe4-6eac-4339-bf88-9a3ac08ef483", "translation" => "Que vous souhaitiez passer une journée de détente en famille, profiter des activités sportives ou simplement vous rafraîchir dans l'aquapark, le Parc des sports et loisirs Sidi Abdellah est l'endroit parfait pour une escapade divertissante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "39b6fa58-ad4f-48f6-b60c-7ab1e05c50fb", "translation" => "سواء كنت ترغب في قضاء يومًا مريحًا مع عائلتك، أو الاستمتاع بالأنشطة الرياضية، أو ببساطة التبريد في الحديقة المائية، فإن حديقة سيدي عبد الله للرياضة والترفيه هو المكان المثالي للهروب والاستمتاع بأوقات ممتعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1393
            ["id" => "c63a9f1e-7936-4eb6-a836-f1ea38006da7", "translation" => "The Souidania square is a pleasant and lively place, offering a relaxed atmosphere conducive to social gatherings, moments of relaxation, and play for children.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "45941346-60d5-4e35-8aca-24bcd08db006", "translation" => "La placette de Souidania est un endroit agréable et animé, offrant une atmosphère détendue propice aux rencontres sociales, aux moments de détente et aux jeux pour les enfants.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bb67c0fe-7975-4814-8ecd-8fad26498539", "translation" => "ساحة السويدانية هي مكان لطيف وحيوي، توفر أجواءً مسترخية تشجع على التجمعات الاجتماعية، وأوقات الاسترخاء، والألعاب للأطفال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1394
            ["id" => "98e7bb08-b240-47a5-b7a3-8ad24d315af3", "translation" => "The Ouled Fayet equestrian center is a true haven for horse riding enthusiasts and a place of relaxation for the whole family. Come and enjoy this welcoming space where a passion for horses blends with the joy of sharing special moments with your loved ones.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c70ae97d-311f-48f5-90e7-76b86c298047", "translation" => "Le centre équestre d'Ouled Fayet est un véritable havre de paix pour les amoureux de l'équitation et un lieu de détente pour toute la famille. Venez profiter de cet espace accueillant où la passion pour les chevaux se mêle à la joie de partager des moments privilégiés avec vos proches.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "83c4e0eb-1d3e-4ec2-b591-cc0e9fcc9e1c", "translation" => "نادي الفروسية أولاد فايت هو ملاذ حقيقي لعشاق ركوب الخيل ومكانًا للاسترخاء لجميع أفراد العائلة. تعال واستمتع بهذا المكان الودي حيث تمتزج شغف الفروسية مع فرحة مشاركة لحظات خاصة مع أحبائك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1395
            ["id" => "4c693bd1-0b2a-4068-9d84-445e527054db", "translation" => "Whether you're seeking a moment of tranquility or a playground for children, this public garden welcomes you with open arms to enjoy nature in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "71960b9a-881c-462b-8eb2-5c3aaef3aeb3", "translation" => "Que vous cherchiez un moment de calme ou une aire de jeux pour les enfants, ce jardin public vous accueille à bras ouverts pour profiter de la nature en plein cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "adea0ee0-b05f-4356-ace7-ce21deac532f", "translation" => "سواء كنت تبحث عن لحظة من الهدوء أو منطقة لعب للأطفال، فإن هذه الحديقة العامة ترحب بك بذراعين مفتوحتين للاستمتاع بالطبيعة في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1396
            ["id" => "3f3f31f7-aae2-4deb-97be-b298384e79e6", "translation" => "The Douera dam is a place that will delight nature lovers, enthusiasts of picturesque landscapes, and anyone seeking moments of serenity in the heart of a preserved oasis.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7a3fc671-0f7a-4f17-b964-645c6b63a163", "translation" => "La barrage de Douera est un lieu qui ravira les amoureux de la nature, les passionnés de paysages pittoresques et tous ceux en quête de moments de sérénité au cœur d'une oasis préservée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2b0fb2fb-e64a-4007-ac8d-f4b9a70a7dc0", "translation" => "سد الدويرة هو مكان سيسرّ عشاق الطبيعة وعشّاق المناظر الخلّابة، وكل من يبحث عن لحظات من السكينة في قلب واحة محفوظة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1397
            ["id" => "75db8704-64fd-4b61-9c9d-9d7a51e214e2", "translation" => "Welcome to this charming garden, a peaceful and friendly green space that will enchant you from the moment you arrive.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "35779fbb-b9bc-44a2-a7a6-53134529e12d", "translation" => "Bienvenue dans ce charmant jardin, un espace vert paisible et convivial qui saura vous charmer dès votre arrivée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ac8dfb13-2fc4-419e-9b59-a7fba051f3c8", "translation" => "مرحبًا في هذه الحديقة الجميلة، مساحة خضراء هادئة وودية ستأسرك منذ لحظة وصولك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1398
            ["id" => "e75c69ae-3353-436d-93c2-6c0677be3b2d", "translation" => "Come get lost in its vast stretches of sand, listen to the gentle sound of the waves, and let yourself be lulled by the magic of this enchanting beach in the heart of Douaouda Marine.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dcabfffd-c342-4baa-8760-410682e03ede", "translation" => "Venez vous perdre dans ses vastes étendues de sable, écouter le doux bruit des vagues et vous laisser bercer par la magie de cette plage enchanteresse au cœur de Douaouda Marine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9299e733-333c-4dbb-9ead-bf0f5450d1db", "translation" => "تعال وانغمس في أراضيها الرملية الشاسعة، استمع إلى صوت الأمواج اللطيف واسمح لنفسك بأن تتركف بسحر هذا الشاطئ الساحر في قلب دواودة البحرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1399
            ["id" => "52c0d931-5a7e-478a-9d9e-d542602ac106", "translation" => "Come immerse yourself in this oasis of entertainment, nature, and joy, where fun awaits at every turn. The Mazafran amusement park is the place where smiles are contagious and happiness is within reach at all times.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "17174abe-7f3e-46e2-a272-6314d124a090", "translation" => "Venez vous immerger dans cette oasis de divertissements, de nature et de joie, où le plaisir est au rendez-vous à chaque instant. Le parc de loisirs Mazafran est le lieu où les sourires sont contagieux et où le bonheur est à portée de main.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "526ccac1-f71e-4d84-9ab6-f75c1b00c75f", "translation" => "تعال وانغمس في هذه الواحة من الترفيه والطبيعة والفرح، حيث المرح في انتظارك في كل لحظة. حديقة التسلية مازافران هو المكان الذي تنتقل فيه الابتسامات بسرعة والسعادة في متناول اليد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1400
            ["id" => "cae9ed30-b17f-47c5-a335-1e8f5ab4e104", "translation" => "Come and discover the picturesque maritime life of Fouka and let yourself be charmed by this authentic port where the scent of salt and the sound of the waves blend to create an unforgettable experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0ae3bc8f-46f5-4bf2-9fdb-afe548fee5bc", "translation" => "Venez découvrir la vie maritime pittoresque de Fouka et laissez-vous charmer par ce port authentique où l'odeur du sel et le bruit des vagues se mêlent pour créer une expérience inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1bfb2202-c66a-4679-a35d-153b4b008463", "translation" => "تعال واكتشف الحياة البحرية الخلابة في فوكة واسمح لنفسك بأن تُسحر بميناء أصيل حيث يمتزج عبير الملح وصوت الأمواج لخلق تجربة لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1401
            ["id" => "06bde67d-81b1-4c92-b84f-ec7a588c127c", "translation" => "The Sidi Boumaaza beach offers splendid panoramas, soothing waters, and a tranquil atmosphere conducive to relaxation and contemplation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "55f0e0e5-89ee-4e5c-95c3-301d78e98de0", "translation" => "La plage de Sidi Boumaaza offre des panoramas splendides, une eau apaisante et une ambiance tranquille propice à la détente et à la contemplation.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "47559dc7-6714-41f8-8d9b-26f5afef89dc", "translation" => "شاطئ سيدي بومعزة يقدم مناظر رائعة، مياه مهدئة، وجو هادئ يشجع على الاسترخاء والتأمل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1402
            ["id" => "c6bd66b0-811a-4165-902e-6bb81ef9d4d1", "translation" => "The Khemisti fishing port is a lively and picturesque place that is of crucial importance to the local community, as it serves as the central point where fishermen unload their catches and seafood products are distributed.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "70e8053b-06b8-4083-abc9-8660ed7c39a2", "translation" => "Le port de pêche de Khemisti est un lieu animé et pittoresque qui est d'une importance cruciale pour la communauté locale, car il est le point central où les pêcheurs déchargent leurs prises et où les produits de la mer sont distribués.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ce8ca735-b7ba-401a-bc27-acab748984cb", "translation" => "ميناء الصيد في خميستي هو مكان حيوي وخلاب ذو أهمية بالغة بالنسبة للمجتمع المحلي، حيث يعتبر النقطة المركزية حيث يفرغ الصيادون مصائدهم ويتم توزيع منتجات البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1403
            ["id" => "02500d5b-892b-4927-b4c0-cc0fa401555f", "translation" => "The Bouharoun port is a place rich in maritime traditions, where you can discover the life of fishermen, buy fresh seafood, and enjoy delicious local cuisine made from freshly caught ingredients. It's a place that reflects the close bond between the community and the sea that surrounds it.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b053c91f-f3e1-40ef-846b-a5b351c1007d", "translation" => "Le port de Bouharoun est un lieu riche en traditions maritimes, où l'on peut découvrir la vie des pêcheurs, acheter des produits de la mer frais et déguster une cuisine locale délicieuse à base de produits fraîchement pêchés. C'est un endroit qui témoigne du lien étroit entre la communauté et la mer qui l'entoure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7cbbf3d2-b2af-4514-8889-97196e541558", "translation" => "ميناء بوهارون هو مكان غني بالتقاليد البحرية، حيث يمكنك اكتشاف حياة الصيادين، وشراء مأكولات بحرية طازجة، والاستمتاع بالمأكولات المحلية اللذيذة المصنوعة من مكونات صيدت حديثًا. إنه مكان يعكس الروابط القوية بين المجتمع والبحر الذي يحيط به.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1404
            ["id" => "fb62872a-b3a6-4dbe-90f3-a857e39ab9c6", "translation" => "Whether for a family leisure day, a getaway with friends, or simply to escape from the daily routine, this beach offers an unforgettable maritime experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "035e7ec7-70b3-4113-b1dc-345f303786f1", "translation" => "Que ce soit pour une journée de loisirs en famille, une escapade entre amis ou simplement pour s'évader du quotidien, cette plage offre une expérience maritime inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "aa184722-0819-4f7e-bcaa-1641b070e7c1", "translation" => "سواء كنت تبحث عن يوم ترفيهي مع العائلة، أو رحلة مع الأصدقاء، أو مجرد الهروب من الروتين اليومي، يقدم هذه الشاطئ تجربة بحرية لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1405
            ["id" => "4f7efaf3-f10b-4884-90af-764216d9917a", "translation" => "The Saidia beach is known for its natural beauty and crystal-clear waters, attracting visitors seeking relaxation and beachside recreation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5060b422-6e91-4fba-ae2a-e2840d834715", "translation" => "La plage de Saïdia est connue pour sa beauté naturelle et ses eaux cristallines, attirant les visiteurs en quête de détente et de loisirs balnéaires.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1c59f509-5d4e-451e-bc08-2d4f111a142b", "translation" => "شاطئ السعيدية معروف بجماله الطبيعي ومياهه الصافية الكريستالية، مما يجذب الزوار الذين يبحثون عن الاسترخاء وأنشطة على الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1406
            ["id" => "3c40c8cb-33da-48e2-bee0-8d9a6714685d", "translation" => "The Swiss beach is an ideal family destination with its two sides, sandy and rocky, offering a varied and pleasant experience. Whether it's swimming, fishing, or relaxation, this beach has everything to offer visitors looking for friendly moments by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f0789ff2-f2ad-4a84-9848-977b59861083", "translation" => "La plage Suisse est une destination familiale idéale avec ses deux côtés, sable et rocheux, offrant une expérience variée et agréable. Entre baignade, pêche et détente, cette plage a tout pour plaire aux visiteurs en quête de moments conviviaux en bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0f7fecf6-177b-4a70-951f-330d79316626", "translation" => "الشاطئ السويسري هو وجهة عائلية مثالية بفضل جانبيه الممتدان، الرملي والصخري، اللذين يقدمان تجربة متنوعة وممتعة. سواء كان الأمر يتعلق بالسباحة أو الصيد أو الترفيه، يحتوي هذا الشاطئ على كل ما يلزم لإسعاد الزوار الذين يبحثون عن لحظات ممتعة بجوار البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1407
            ["id" => "973617d6-61f7-40a4-868e-c154be72cef4", "translation" => "The Ain Tagourait beach is a picturesque seaside destination perfect for relaxing, swimming, and enjoying the simple pleasures of beach life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e5355fc4-dbb5-47fd-bf6f-a935692d8fc6", "translation" => "La plage Ain Tagourait est une destination balnéaire pittoresque idéale pour se détendre, se baigner et profiter des plaisirs simples de la vie en bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bd0d147e-287b-4887-bfce-34fa9b520b4b", "translation" => "شاطئ عين تقورايت هو وجهة ساحرة على الشاطئ مثالية للاسترخاء والسباحة والاستمتاع ببساطة متع الحياة على الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1408
            ["id" => "3c19ae26-11ec-4a4a-8741-edf71cb3381b", "translation" => "The Ain Tagourait waterfalls offer an enchanting display of cascades, clear water, and lush landscapes. It's an ideal place to rejuvenate, connect with nature, and enjoy a refreshing getaway in the heart of a preserved natural environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f32e6d4f-4823-4e72-b89c-1a612b4f7e04", "translation" => "Les chutes d'Ain Tagourait offrent un spectacle envoûtant de cascades, d'eau claire et de paysages verdoyants. C'est un lieu idéal pour se ressourcer, se connecter avec la nature et profiter d'une escapade rafraîchissante au cœur d'un environnement naturel préservé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9dfd65d1-95f7-4417-9a82-06184989dbf9", "translation" => "شلالات عين تقورايت تقدم عرضًا ساحرًا من الشلالات والمياه النقية والمناظر الخضراء. إنها مكان مثالي للاسترخاء، والاتصال بالطبيعة، والاستمتاع بإجازة منعشة في قلب بيئة طبيعية محمية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1409
            ["id" => "9b871037-4372-4709-bef9-4452ca0fea7c", "translation" => "Located in a small, well-sheltered bay, the Kouali beach provides a peaceful and safe setting to enjoy the pleasures of swimming and beach games.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "63c42f33-ca72-4a0e-bf39-3bddbda452af", "translation" => "Située dans une petite baie bien protégée du vent, la plage Kouali offre un cadre paisible et sûr pour profiter des joies de la baignade et des jeux de plage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "518c1c58-5a00-4482-97f3-f45cfbc26a28", "translation" => "موجودة في خليج صغير ومحمي تمامًا من الرياح، يقدم شاطئ كوالي إطارًا هادئًا وآمنًا للاستمتاع بمتعة السباحة وألعاب الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1410
            ["id" => "3a600cf8-4642-46d8-8117-47022fed1a79", "translation" => "The port of Tipasa is a picturesque place, combining the charm of a traditional fishing port with a rich historical heritage. It's a place where you can stroll along the docks, appreciate the local maritime activity, and enjoy stunning views of the Mediterranean Sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "064361de-1fd0-4bdf-92fc-9e199392b212", "translation" => "Le port de Tipasa est un endroit pittoresque, alliant le charme d'un port de pêche traditionnel à un riche héritage historique. C'est un lieu où l'on peut se promener le long des quais, apprécier l'activité maritime locale et profiter d'une vue imprenable sur la mer Méditerranée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "59397fa1-2a03-433e-9906-5bc2c3a20470", "translation" => "ميناء تيبازة هو مكان جميل، يجمع بين سحر ميناء صيد تقليدي وتراث تاريخي غني. إنه مكان يمكنك فيه التجول على طول الأرصفة، وتقدير نشاط البحر المحلي، والاستمتاع بإطلالات رائعة على البحر الأبيض المتوسط.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1411
            ["id" => "5729d169-3c8b-46a1-89d0-cb936a19eba1", "translation" => "The Matares beach is renowned for its preserved natural beauty and tranquil environment, making it a popular destination for both locals and visitors seeking a pleasant place to relax by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ceac1e7d-1fbb-40b6-93ff-02fdd2151d46", "translation" => "La plage de Matares est réputée pour sa beauté naturelle préservée et son environnement tranquille, ce qui en fait une destination prisée des habitants et des visiteurs en quête d'un lieu agréable pour se détendre au bord de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5a7803bd-8799-4697-a31c-b01b403bee60", "translation" => "شاطئ مطاريس مشهور بجماله الطبيعي المحافظ عليه وبيئته الهادئة، مما يجعله وجهة محببة للسكان المحليين والزوار الباحثين عن مكان ممتع للاسترخاء على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1412
            ["id" => "1cfd7e9b-35ca-4e69-af26-7edc645a39ec", "translation" => "The Blue beach 1 is a peaceful and natural destination. It offers a mixture of pebbles, rocks, and sand, with a family-friendly atmosphere and a quieter area for young people.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "897e72cb-43b4-4a22-979b-f6ba6e43fde2", "translation" => "La Plage Bleue 1 est une destination calme et naturelle. Elle offre un mélange de galets, de rochers et de sable, avec une ambiance conviviale pour les familles et une zone plus tranquille pour les jeunes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "10224472-c3d6-48f4-9d0e-b16d11d28ae5", "translation" => "الشاطئ الازرق 1 هو وجهة هادئة وطبيعية. يقدم مزيجًا من الحصى والصخور والرمل، مع جو عائلي ودود ومنطقة أكثر هدوءًا للشباب.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1413
            ["id" => "886f80fa-3b0d-499c-b214-3979819ff5fa", "translation" => "The Blue beach 2 is a pleasant seaside destination, offering clear beautiful water and convenient parking with ample space. However, the narrow and shallow beach may make it less suitable for families with young children.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f8c7d427-b182-4384-833e-b4d064e8fb87", "translation" => "La plage Bleue 2 est une destination balnéaire agréable, offrant une belle eau claire et une facilité de stationnement avec un parking spacieux. Cependant, la plage étroite et peu profonde peut la rendre moins adaptée aux familles avec de jeunes enfants.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7b38dd10-bc5a-439b-9f6f-9478a6d0bd19", "translation" => "الشاطئ الازرق 2 هو وجهة ساحلية لطيفة، حيث توفر مياهًا جميلة وواضحة ومرافق واسعة لوقوف السيارات. ومع ذلك، يمكن أن يجعل الشاطئ الضيق والضحل ذلك أقل ملاءمة للعائلات ذات الأطفال الصغار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1414
            ["id" => "e5b17299-a58e-4b18-b800-88d8abde9ca0", "translation" => "The El Beldj beach is a tranquil and picturesque place with easy access, convenient parking, and a relatively calm atmosphere. It's a small pebble beach that offers a different experience from the usual sandy beaches.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "21669a67-7df8-4aaa-b68d-627d66a8e959", "translation" => "La plage d’el Beldj est un endroit paisible et pittoresque, avec un accès facile, un parking pratique et une ambiance relativement calme. C'est une petite plage de galets qui offre une expérience différente des plages de sable habituelles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a66cf29e-287e-4eef-974f-2c7a37edf4a8", "translation" => "شاطئ البلج هو مكان هادئ وجميل، مع وصول سهل ومواقف سيارات مريحة، وجو هادئ نسبيًا. إنه شاطئ صغير من الحصى يقدم تجربة مختلفة عن الشواطئ الرملية المعتادة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1415
            ["id" => "af9fb23a-d5a3-4c6a-b073-2fe7d6360a52", "translation" => "The Carob beach is an ideal destination for families looking for a clean and peaceful family beach. It's a pleasant place to spend a relaxed day by the sea, but it is advisable to exercise caution if you have young children due to the presence of rocks on the beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5db40c1f-9752-4030-b37c-4fc6e28a0084", "translation" => "La plage du Caroubier est une destination idéale pour les familles en quête d'une plage familiale, propre et calme. C'est un lieu agréable pour passer une journée détendue en bord de mer, mais il est conseillé de faire preuve de prudence si vous avez de jeunes enfants, en raison de la présence de rochers sur la plage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a4da8768-3c77-440f-a466-5587ef3fbc6b", "translation" => "شاطئ الخروب هو وجهة مثالية للعائلات الباحثة عن شاطئ نظيف وهادئ. إنه مكان لطيف لقضاء يوم مسترخٍ على شاطئ البحر، ولكن من المستحسن أن تكونوا حذرين إذا كان لديكم أطفال صغار بسبب وجود صخور على الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1416
            ["id" => "afa15376-d89a-4d0d-8409-cf49d1b10d28", "translation" => "The Tafza square provides a spacious public area with refreshing fountains and a variety of nearby shops. It's a lively and welcoming place where residents and visitors can gather, shop, and enjoy a friendly atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7b6853fd-7db2-4fb9-a3a7-9cc69811d527", "translation" => "La place Tafza offre un espace public spacieux avec des fontaines rafraîchissantes et une variété de commerces à proximité. C'est un endroit animé et accueillant, où les résidents et les visiteurs peuvent se réunir, faire des achats et profiter d'une atmosphère conviviale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "409d11dc-9e16-4b91-80de-04ab9f0d6d9a", "translation" => "ساحة تافزة توفر مساحة عامة واسعة مع نوافير منعشة ومجموعة متنوعة من المحلات التجارية القريبة. إنها مكان حيوي ومرحب، حيث يمكن للسكان والزوار التجمع والتسوق والاستمتاع بأجواء ودية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1417
            ["id" => "ec5663fa-8d1c-4400-9892-6c519f742ee7", "translation" => "The martyr’s square is a bustling large square known for its pleasant setting. It is located in the heart of the city and provides a welcoming and dynamic public space for residents and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fd038eec-026d-48d7-ae98-2acf2a1aeb47", "translation" => "La place des Martyrs est une grande place animée, connue pour son cadre agréable. Elle est située au cœur de la ville et offre un espace public accueillant et dynamique pour les résidents et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "49d8a614-859f-4484-b297-714b63d98bfe", "translation" => "ساحة الشهداء هي ساحة كبيرة حيوية مشهورة بمحيطها اللطيف. تقع في قلب المدينة وتوفر مساحة عامة ترحيبية وديناميكية للسكان والزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1418
            ["id" => "8a8225ae-cdb2-4f28-a8b9-e4fa669543ed", "translation" => "The El Hamdania beach is a popular family destination where visitors can enjoy a peaceful day of relaxation surrounded by a preserved natural setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6c3871bc-2b3d-4205-8c3f-bd493f2adced", "translation" => "La plage d’el Hamdania est une destination familiale appréciée, où les visiteurs peuvent profiter d'une journée de détente en toute quiétude, entourés d'un cadre naturel préservé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "63e82170-3d4e-4bcc-aeab-f0c922be88cb", "translation" => "شاطئ الحمدانية هو وجهة عائلية محببة حيث يمكن للزوار الاستمتاع بيوم هادئ من الاسترخاء محاطين بإعداد طبيعي محافظ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1419
            ["id" => "1285f4d2-2922-4664-98ca-fb9d58c4869c", "translation" => "The Oued Belaa beach is a well-equipped and welcoming destination, providing ample space to enjoy the sea and sun, along with convenient facilities to make your stay pleasant and comfortable. It's an ideal place to spend a relaxing day with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8fc9dc86-ccb0-4f1d-931f-ad2866769ac9", "translation" => "La plage d'Oued Belaa est une destination bien équipée et accueillante, offrant un espace généreux pour profiter de la mer et du soleil, ainsi que des installations pratiques pour rendre le séjour agréable et confortable. C'est un lieu idéal pour passer une journée de détente en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "00ce515a-8f73-4a32-aeb8-9b1677114c0d", "translation" => "شاطئ واد البلاع وجهة مجهزة بشكل جيد ومرحبة، حيث يوفر مساحة وفيرة للاستمتاع بالبحر والشمس، بالإضافة إلى مرافق ملائمة لجعل إقامتك ممتعة ومريحة. إنه مكان مثالي لقضاء يوم من الاسترخاء مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1420
            ["id" => "d35316d7-e3c8-4ecf-a535-fc7fa5f031d8", "translation" => "The Cherchell port is a picturesque place where you can enjoy a peaceful and serene atmosphere while discovering the archaeological treasures of the region. A perfect place to recharge and enjoy a pleasant day with family.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6a406ef2-4e7d-4c1c-9eae-3f9cdef26129", "translation" => "Le port de Cherchell est un lieu pittoresque où l'on peut profiter d'une ambiance paisible et sereine, tout en découvrant les trésors archéologiques de la région. Un endroit parfait pour se ressourcer et profiter d'une agréable journée en famille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2c66ac6b-6f88-45bb-8074-2d86549764f6", "translation" => "ميناء شرشال هو مكان جميل حيث يمكنك الاستمتاع بأجواء هادئة وساكنة، بينما تستكشف كنوز المنطقة الأثرية. مكان مثالي للاسترخاء وقضاء يوم ممتع مع العائلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1421
            ["id" => "cced96e7-732e-4ca8-b820-65f45a1370b0", "translation" => "The West gate is an impressive Roman relic, reminiscent of the city's fascinating history. It's an iconic site for archaeology enthusiasts and a must-visit destination for those wishing to explore the historical heritage of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "28fee7b5-935d-41dd-a4b0-2d1ae6a54fa8", "translation" => "La porte de l'ouest, est un impressionnant vestige romain, rappelant l'histoire fascinante de la ville. C'est un lieu emblématique pour les passionnés d'archéologie et une destination à ne pas manquer pour ceux qui souhaitent découvrir le patrimoine historique de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "44227eea-7bbd-4a18-9176-8b9126ae9163", "translation" => "باب الغرب هي آثار رومانية مذهلة تجسد تاريخ المدينة الرائع. إنها موقع رمزي لعشاق علم الآثار ووجهة يجب على الراغبين في اكتشاف التراث التاريخي للمنطقة عدم تفويتها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1422
            ["id" => "24cd3ce8-429b-4f02-ad2f-993ce26c4d2f", "translation" => "The Red point beach is a hidden gem offering a calm and serene atmosphere. Although it is rocky and lacks sand, it is worth a visit, especially for families seeking tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6bd17e61-e05b-4127-9753-b0e813814c6f", "translation" => "La plage de la Pointe Rouge est un joyau caché offrant une ambiance calme et sereine. Bien qu'elle soit rocheuse et sans sable, elle vaut le détour, surtout pour les familles en quête de quiétude.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "98ee055b-8e5d-47b3-8a3f-4a1da4dfb4ab", "translation" => "شاطيء القمة الحمراء هو جوهرة مخفية تقدم أجواءً هادئة وساكنة. على الرغم من أنها صخرية وتفتقر إلى الرمال، إلا أنها تستحق الزيارة، خصوصًا للعائلات الباحثة عن السكينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1423
            ["id" => "e3194505-45dc-4468-a722-242dec220efe", "translation" => "The Little Vichy beach is a welcoming family-friendly place, offering a beautiful and clean setting. It is a rocky beach, ideal for those seeking tranquility and beautiful panoramas. However, please be aware of the presence of rocks in the water.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cc5a5a1a-f01b-4fc8-a54c-157fad9dd30f", "translation" => "La plage Petit Vichy est un lieu familial accueillant, offrant un cadre superbe et propre. C'est une plage rocheuse, idéale pour les personnes en recherche de tranquillité et de beaux panoramas. Toutefois, il faut prendre en compte la présence de rochers dans l'eau.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ce890edf-563f-43df-be95-9c4916b1c816", "translation" => "شاطئ فيشي الصغير هو مكان عائلي مرحب، حيث يوفر إطارًا رائعًا ونظيفًا. إنه شاطئ صخري، مثالي لأولئك الذين يبحثون عن الهدوء والمناظر الجميلة. ومع ذلك، يجب مراعاة وجود الصخور في الماء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1424
            ["id" => "a155924b-8c68-4a42-bc04-fcde9af1d4ac", "translation" => "The Roman lady beach offers easy access, a calm and peaceful atmosphere, and an opportunity to relax. It's the perfect place to escape from the hustle and bustle of everyday life and indulge in the simple pleasures of the beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b1e24c39-4b44-4e02-85e2-b32dab291b36", "translation" => "La plage Madame Romaine offre un accès facile, une ambiance calme et paisible, et une occasion de se détendre. C'est l'endroit idéal pour s'évader du tumulte de la vie quotidienne et se laisser bercer par les plaisirs simples de la plage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b21798b0-06b9-403a-81c7-c929b7651b7e", "translation" => "شاطئ السيدة الرومانية يوفر وصولًا سهلاً، وجوًا هادئًا وسلميًا، وفرصة للاسترخاء. إنه المكان المثالي للهروب من صخب الحياة اليومية والاستمتاع بلذائذ البساطة على الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1425
            ["id" => "4b56e962-c439-4d67-94ac-e27932295100", "translation" => "Whether it's for relaxing alone, with family, or with friends, the Ziwa beach is the perfect place to create wonderful summer memories and fully savor the pleasures of the coast.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "35e13be1-20fb-4d3b-aee5-de69b7489a04", "translation" => "Que ce soit pour se détendre en solitaire, en famille ou entre amis, la plage Ziwa est l'endroit parfait pour se créer de merveilleux souvenirs estivaux et savourer pleinement les plaisirs de la côte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7d60bc6d-728e-4fd5-99de-c244d710d49b", "translation" => "سواء كنت تبحث عن الاسترخاء بمفردك أو مع العائلة أو مع الأصدقاء، فإن شاطئ زيوة هو المكان المثالي لإنشاء ذكريات صيفية رائعة والاستمتاع بكل متع الساحل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1426
            ["id" => "f6ce9de1-1b2e-4e31-96a5-9ed8cec3bdcf", "translation" => "The Sidi Ghiles beach is an ideal place to escape the hustle and bustle of daily life, providing a peaceful and tranquil atmosphere where one can rejuvenate in harmony with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a797b381-8f02-471e-ba42-122839246748", "translation" => "La plage de Sidi Ghiles est un endroit idéal pour échapper à l'agitation de la vie quotidienne, offrant une ambiance paisible et tranquille où l'on peut se ressourcer en harmonie avec la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "13fd82da-b297-4052-8f07-c512c0022e77", "translation" => "شاطئ سيدي غيلاس هو مكان مثالي للابتعاد عن صخب الحياة اليومية، حيث يوفر أجواءً هادئة وسلمية يمكن للزائرين من خلالها أن يعيدوا شحن طاقتهم والتناغم مع الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1427
            ["id" => "7ea73f48-08f4-4719-bc85-0c82e9372040", "translation" => "Whether you're in search of adventure, relaxation, or cultural exploration, the Sea calf beach is the place to remember. Treat yourself to a magical getaway and come make unforgettable memories in this little piece of paradise that awaits you.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "06d67d04-c385-4c00-bba8-af35822166e1", "translation" => "Que vous soyez en quête d'aventure, de relaxation ou de découvertes culturelles, la plage du Veau Marin est l'adresse à retenir. Offrez-vous une escapade magique et venez créer des souvenirs inoubliables dans ce petit coin de paradis qui n'attend que vous.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "70999321-e583-4bda-9871-32433fda8cd9", "translation" => "سواء كنت تبحث عن المغامرة، الاسترخاء أو الاستكشاف الثقافي، فإن شاطئ العجل البحري هو العنوان الذي يجب تذكيره. امنح نفسك فرصة للهروب الساحر وتعال لتخلق ذكريات لا تُنسى في هذه الجنة الصغيرة التي تنتظرك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1428
            ["id" => "dd570d74-39f4-42ea-b1f7-6496ca87abf9", "translation" => "The beach features a rocky landscape inland, with sea urchins and seaweed, adding a touch of natural diversity. For scuba diving enthusiasts, it's a true paradise, offering opportunities for unforgettable underwater discoveries.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "64c103d7-f1ad-41c7-9e44-8966c1537dbd", "translation" => "La plage présente un paysage rocheux à l'intérieur, avec des oursins et des algues, ajoutant une touche de diversité naturelle. Pour les amateurs de plongée sous-marine, c'est un véritable paradis, offrant des opportunités de découvertes sous-marines inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "34e66e7d-a6e2-4bac-a6ac-a8505cebc9dd", "translation" => "الشاطئ يتميز بمناظر صخرية في الداخل، بوجود أسماك البحر والطحالب، مما يضيف لمسة من التنوع الطبيعي. بالنسبة لهواة الغوص، إنها جنة حقيقية تقدم فرصًا لا تُنسى لاكتشافات تحت الماء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1429
            ["id" => "5e3a98d8-5509-4fa7-bde9-369e8025a792", "translation" => "The Gounini beach is perfect for families, providing a family-friendly environment for relaxation and bonding moments. You can fully enjoy this beautiful beach with your loved ones, whether it's your children or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3df62f1a-17b4-4fb5-b65e-1ceef5be9ac3", "translation" => "La plage Gounini est tout indiqué pour les familles, offrant un cadre familial propice aux moments de détente et de partage. Vous pourrez profiter pleinement de cette belle plage avec vos proches, qu'il s'agisse de vos enfants ou de vos amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ebd855cf-e929-4785-b45d-a421ceed87ff", "translation" => "شاطئ ڨونيني هو مكان مناسب جدًا للعائلات، حيث يوفر بيئة عائلية تشجع على أوقات الاسترخاء والتواصل. يمكنكم الاستمتاع بشكل كامل بشاطئ جميل مع أحبائكم، سواء كانوا أطفالكم أو أصدقائكم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1430
            ["id" => "4a2517f5-8ec2-4e15-8e96-bc8f4f1d9648", "translation" => "The Hadjret Ennous beach is a place where you can lose yourself in contemplation and wonder, letting the soothing sound of waves crashing against the rocks envelop you. Come explore this extraordinary beach and discover a natural paradise of stunning beauty that will leave you with unforgettable memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "35a9c4f6-767a-4c50-ba46-d2a73b468553", "translation" => "La plage de Hadjret Ennous est un endroit où l'on peut se perdre dans la contemplation et l'émerveillement, en se laissant bercer par le bruit apaisant des vagues se brisant sur les rochers. Venez explorer cette plage extraordinaire et découvrez un paradis naturel d'une beauté saisissante, qui vous laissera des souvenirs inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "432ec087-08cb-4f3e-bad4-ee0cdc191904", "translation" => "شاطئ حجرة النص هي مكان يمكنك فيه أن تضيع في التأمل والدهشة، مدعوًا لتستمع إلى صوت الموجات الهادئة وهي تتحطم على الصخور. تعال واستكشف هذا الشاطئ الاستثنائي واكتشف جنة طبيعية من جمال مذهل ستترك لديك ذكريات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1431
            ["id" => "ba1eaf26-4e6e-4ccd-99a5-e601d627fa26", "translation" => "Come discover the preserved beauty of the Messelmoun beach, a place where pleasure, safety, and serenity come together to offer you an unforgettable beach experience. Enjoy the perfect setting to share moments of happiness with your family and leave with memorable memories of this enchanting destination.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "00995612-f793-485a-a126-89023dd43fe3", "translation" => "Venez découvrir la beauté préservée de la plage Messelmoun, un lieu où plaisir, sécurité et sérénité se conjuguent pour vous offrir une expérience balnéaire inoubliable. Profitez du cadre idéal pour partager des moments de bonheur en famille et repartez avec des souvenirs mémorables de cette destination enchanteresse.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c8084bcc-51e6-47f7-9f04-e4ea4f9cfdfd", "translation" => "تعالوا اكتشفوا جمال شاطئ مسلمون، مكان حيث يتجمع المتعة والأمان والسكينة ليقدموا لكم تجربة شاطئ لا تُنسى. استمتعوا بالإعداد المثالي لمشاركة لحظات سعادة مع عائلتكم واتركوا مع ذكريات لا تُنسى من هذه الوجهة الساحرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1432
            ["id" => "25f0561e-9fbb-4263-a1d6-46963acc8725", "translation" => "The Sitges farm is a place steeped in memory, beauty, and courage, offering visitors the opportunity to discover an important part of history and reminisce about the glorious past of this historic site.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e0c52762-f08d-4cf7-a010-a7fa8171af6d", "translation" => "La ferme Sitgès est un lieu empreint de mémoire, de beauté et de courage, offrant aux visiteurs l'opportunité de découvrir un pan important de l'histoire et de se remémorer le passé glorieux de ce lieu historique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "77d32290-733c-4692-8b2e-1dd300a88ea1", "translation" => "مزرعة سيجاس هي مكان مملوء بالذكريات والجمال والشجاعة، حيث توفر للزوار فرصة اكتشاف جزء مهم من التاريخ والتفكير في الماضي المجيد لهذا الموقع التاريخي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1433
            ["id" => "c2dc8ddc-1a5a-456a-b894-652e042eb927", "translation" => "The soft and soothing sensation of the pebbles beneath your feet adds a unique touch to the beach experience at Boumaizene beach. It's a genuine pleasure to stroll along the shore, listening to the gentle sound of the waves caressing the pebbles.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ed34eeec-3469-4511-96d3-1477e0e608ca", "translation" => "La sensation douce et apaisante des galets sous vos pieds ajoute une touche particulière à l'expérience balnéaire de la plage Boumaïzene. C'est un véritable plaisir de se promener le long du rivage, en écoutant le doux bruit des vagues qui viennent caresser les galets.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ee3bce6b-9d19-4be8-b4f6-c1c48d7d8de1", "translation" => "إحساس الحصى الناعم والمهدئ تحت أقدامك يضيف لمسة فريدة إلى تجربة الشاطئ في شاطئ بومايزن. إنه متعة حقيقية أن تتجول على طول الشاطئ، وتستمع إلى صوت الأمواج اللطيفة وهي تلمس الحصى برفق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1434
            ["id" => "154af7f8-52db-440c-acbf-5816563c888a", "translation" => "The Oued Sebt beach is a place where you can enjoy a vast stretch of sand to relax and have fun. It offers plenty of space for strolling, sunbathing, or engaging in various beach activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8043e5d3-a0e6-413e-b34f-815343ba0805", "translation" => "La plage d’Oued Sebt est un lieu où vous pourrez profiter d'une étendue de sable vaste pour vous détendre et vous amuser. Elle offre amplement d'espace pour se promener, se prélasser au soleil ou profiter de diverses activités balnéaires.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bf290b13-5e6e-4999-b946-0b1e08667db1", "translation" => "شاطئ واد السبت هو مكان يمكنكم فيه الاستمتاع بمساحة واسعة من الرمال للراحة والمرح. إنه يوفر مساحة كبيرة للتجول، والاستلقاء تحت أشعة الشمس، أو الاستمتاع بمجموعة متنوعة من الأنشطة الشاطئية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1435
            ["id" => "dcfeb572-5290-42ea-8020-bfef1ee7aaa4", "translation" => "If you're in search of a getaway away from the crowds, the 3rd point beach is the perfect place to recharge and enjoy a moment of tranquility in communion with nature. Come discover this wild cove and let yourself be enchanted by its authentic charm.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c7f7a033-f20e-4f3b-9b5f-a440972235df", "translation" => "Si vous êtes en quête d'une escapade loin de la foule, la plage de la 3ème Pointe est l'endroit idéal pour vous ressourcer et profiter d'un moment de tranquillité en communion avec la nature. Venez découvrir cette crique sauvage et laissez-vous envoûter par son charme authentique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b8bc1b4e-f1cd-4b82-bcdf-efc54896dcae", "translation" => "إذا كنت تبحث عن هروب بعيدًا عن الزحام، فإن شاطئ القمة الثالثة هو المكان المثالي للتجديد والاستمتاع بلحظة من السكينة في اتصال وثيق مع الطبيعة. تعال اكتشف هذه الجرف البري ودع نفسك تسحر بسحرها الأصيل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1436
            ["id" => "96d3ac4d-c7c4-44aa-b887-8ac0e6f94715", "translation" => "The 2nd point beach is a true hidden gem, offering preserved natural beauty and a slightly more adventurous access. To reach it, you'll need to walk as it's located in a remote position, and the road leading to it is unpaved.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0c3936ed-0e5c-4799-8bfa-c1130528c746", "translation" => "La plage de la 2ème pointe est un véritable joyau caché, offrant une beauté naturelle préservée et un accès un peu plus aventureux. Pour y accéder, il vous faudra marcher, car elle est située dans une position éloignée et la route pour y arriver est en terre.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e28a60e9-5c37-48aa-80c9-350f13171c75", "translation" => "شاطئ النقطة الثانية هو جوهرة مخفية حقيقية، تقدم جمال الطبيعة المحافظ ووصولًا مغامرًا قليلاً. للوصول إليه، ستحتاج إلى المشي، حيث يقع في موقع نائي والطريق المؤدية إليه غير معبدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1437
            ["id" => "2271d2a5-133a-413f-9c23-d6b728898342", "translation" => "Be prepared for a bit of adventure to access this beach, as it's precisely this limited accessibility that makes it a special place, providing a peaceful and authentic setting to relax by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "26435a38-296b-4f5d-bb81-33b66ab71029", "translation" => "Soyez prêt à vous aventurer légèrement pour accéder à cette plage, car c'est précisément cette accessibilité limitée qui en fait un lieu spécial, offrant un cadre paisible et authentique pour se détendre au bord de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "de2893d8-4072-4b3b-9f9b-b351cde14320", "translation" => "كن مستعدًا للمغامرة قليلاً للوصول إلى هذا الشاطئ، لأنه بالضبط هذه الوصولية المحدودة تجعله مكانًا خاصًا، حيث يوفر إطارًا هادئًا وأصيلًا للاسترخاء على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1438
            ["id" => "73f4d329-0717-4f5a-87a9-b0fa693fc437", "translation" => "The Gouraya fishing port is a must-visit for those seeking authenticity, maritime adventure, and culinary discoveries. Come and experience the unique charm of this picturesque port, where the sea and the lives of fishermen unfold before your amazed eyes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "945095fa-9dcf-4421-85f2-ef4d7abdd7fa", "translation" => "Le port de pêche de Gouraya est une étape incontournable pour ceux qui recherchent l'authenticité, l'aventure maritime et les découvertes culinaires. Venez vivre l'expérience unique de ce port pittoresque, où la mer et la vie des pêcheurs se dévoilent sous vos yeux émerveillés.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "33c06518-dc1e-4594-a3f8-52ff344bc258", "translation" => "ميناء الصيد قوراية هو محطة لا غنى عنها لأولئك الذين يبحثون عن الأصالة والمغامرة البحرية واكتشافات الطهي. تعال واستمتع بتجربة فريدة في هذا الميناء الجميل، حيث تكشف البحر وحياة الصيادين أمام عيونك المدهشة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1439
            ["id" => "9fcda1a6-e5d2-4275-87ec-27a2102f92c7", "translation" => "This beach is a bright and welcoming place, perfectly suited to the needs of families. Its warm atmosphere makes it an ideal spot for relaxing days with your loved ones.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "42fe6f1a-e6d9-4024-832f-82610a04a46f", "translation" => "Cette plage est un lieu lumineux et accueillant, parfaitement adapté aux besoins des familles. Son atmosphère chaleureuse en fait un endroit idéal pour des journées de détente en compagnie de vos proches.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6766fb69-a34b-45ad-a921-a29b976e55a5", "translation" => "هذا الشاطئ هو مكان مشرق ومرحب، ملائم تمامًا لاحتياجات العائلات. جوه الدافئ يجعله مكانًا مثاليًا لقضاء أيام استرخاء مع أحبائك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1440
            ["id" => "3b03d9b7-d618-4f10-9b2b-b136860d4946", "translation" => "The Sacred wood beach is an ideal tourist destination for rejuvenation, offering ample space for visitors. Despite its beauty, it remains uncrowded, allowing you to enjoy a peaceful and preserved environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6627512a-6d96-44a2-ae5a-3c7af342826d", "translation" => "La Plage Bois Sacré est une destination touristique idéale pour se ressourcer en offrant amplement d'espace pour les visiteurs. Malgré sa beauté, elle reste peu fréquentée, vous permettant de profiter d'un environnement calme et préservé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9590f15f-8c8a-448d-824f-4a91cea5b02b", "translation" => "شاطئ الخشب المقدس هو وجهة سياحية مثالية لإعادة الطاقة حيث يوفر مساحة واسعة للزوار. على الرغم من جماله، إلا أنه يظل غير مزدحم، مما يتيح لك الاستمتاع ببيئة هادئة ومحافظة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1441
            ["id" => "a6939f12-cc20-4a18-bde2-ad52904ff63d", "translation" => "This beach is an ideal choice for families, providing a family-friendly and safe environment. The sea is not deep, allowing young children to swim with peace of mind and without worry.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aa5577a4-666f-4526-9031-87b849cb237f", "translation" => "Cette plage est un choix idéal pour les familles, offrant un cadre familial et sécurisé. La mer n'est pas profonde, permettant aux petits enfants de nager en toute quiétude, sans crainte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7373a4e4-7aa6-408b-9b5f-03c96e58fec9", "translation" => "هذا الشاطئ هو خيار مثالي للعائلات، حيث يوفر بيئة عائلية وآمنة. البحر ليس عميقًا، مما يسمح للأطفال الصغار بالسباحة بسلام وبدون قلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1442
            ["id" => "e9a6d231-b885-4db5-b4de-45f755bc9f31", "translation" => "The Sidi Brahim beach is a fairly large beach, offering plenty of space for visitors. Its sand has a coarse texture, adding a unique touch to its natural charm. It can be easily recognized by an off-center rock on the east side.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7f96c998-8ae2-40f1-8e4f-b056a2ad8902", "translation" => "La plage de Sidi Brahim est une plage assez grande, offrant amplement d'espace pour les visiteurs. Son sable est de texture grossière, ajoutant une touche particulière à son charme naturel. On peut la reconnaître facilement grâce à un rocher excentré du côté Est.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c4f2bdf0-757d-4b95-88fb-7fb8f3a624b5", "translation" => "شاطئ سيدي إبراهيم هو شاطئ كبير بما فيه الكفاية، حيث يوفر مساحة واسعة للزوار. رماله خشنة القوام، مما يضيف لمسة فريدة لجاذبيته الطبيعية. يمكن التعرف عليه بسهولة من خلال وجود صخرة غير مركزة على الجانب الشرقي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1443
            ["id" => "dcf7145e-6b39-48ba-a64e-24e500bcc8d1", "translation" => "Whether you want to sunbathe, engage in water activities, or simply marvel at picturesque sunsets, this beach will meet all your expectations.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aa622ba4-9c18-4d18-acb6-98b08a674dfb", "translation" => "Que vous souhaitiez vous prélasser au soleil, vous adonner à des activités nautiques ou simplement vous émerveiller devant les couchers de soleil pittoresques, cette plage répondra à toutes vos attentes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "664cb662-aab0-41dc-92bc-d4339d7722a2", "translation" => "سواء كنت ترغب في الاستلقاء تحت أشعة الشمس، أو ممارسة الأنشطة البحرية، أو مجرد التأمل في مناظر الغروب الخلابة، هذا الشاطئ سيلبي جميع توقعاتك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1444
            ["id" => "6273ebb6-95c2-40f9-9eda-e87a8369cc9d", "translation" => "The Larhat 2 beach is a peaceful and preserved place where you can escape from the daily stress and connect with the surrounding nature. Come explore this coastal paradise and enjoy unforgettable moments, creating magical memories by the water.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "48a3a674-7cd3-416a-9889-ac43a4c72657", "translation" => "La plage Larhat 2 est un lieu paisible et préservé, où vous pourrez échapper au stress quotidien et vous connecter à la nature environnante. Venez explorer ce paradis côtier et profiter de moments inoubliables, en créant des souvenirs magiques au bord de l'eau.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "efeaef18-eb59-4dfc-ac21-6d90e3686d7c", "translation" => "شاطئ الأرهاط 2 هو مكان هادئ ومحافظ، حيث يمكنك الابتعاد عن الضغوط اليومية والتواصل مع الطبيعة المحيطة. تعال واستكشف هذه الجنة الساحلية واستمتع بلحظات لا تُنسى، وأنشئ ذكريات ساحرة على ضفاف المياه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1445
            ["id" => "d9fc9119-7897-43aa-8c76-cd55d0b424b3", "translation" => "The Ikhlifayen beach is a true haven of peace, far from the hustle and bustle of crowded beaches, where you can escape from the outside world and connect with the raw beauty of nature. Come discover this unique cove and enjoy an authentic and unforgettable beach experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "06508412-37d5-4f21-8a57-bb665d7287e9", "translation" => "La plage Ikhlifayen est un véritable havre de paix, loin de l'agitation des plages bondées, où vous pourrez vous échapper du monde extérieur et vous connecter avec la beauté brute de la nature. Venez découvrir cette crique unique et profiter d'une expérience balnéaire authentique et inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a9c0562e-5257-47db-aff0-d626b63a08b6", "translation" => "شاطئ اخليفاين هو ملاذ حقيقي للسلام، بعيدًا عن صخب الشواطئ المزدحمة، حيث يمكنك الهروب من العالم الخارجي والاتصال بجمال الطبيعة الخام. تعال واكتشف هذه الهجيرة الفريدة واستمتع بتجربة شاطئية أصيلة ولا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1446
            ["id" => "3e0c38e9-6926-48b5-8817-abb7a2dc3eba", "translation" => "Whether you're looking to relax on the warm sand, explore the surroundings, or immerse yourself in the natural beauty of the sea, the Ras Taizert beach is an enchanting destination that will surely captivate you.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "74359011-c847-4fd8-9fdc-bc027bece3f9", "translation" => "Que vous cherchiez à vous détendre sur le sable chaud, à explorer les environs ou à vous immerger dans la beauté naturelle de la mer, la plage Ras Taizert est une destination enchanteresse qui ne manquera pas de vous émerveiller.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "648ca143-9cb5-4941-9f6a-365ad23214d4", "translation" => "سواء كنتم تبحثون عن الاسترخاء على الرمال الدافئة، أو استكشاف المناطق المحيطة، أو الانغماس في جمال الطبيعة البحرية، شاطئ رأس تايزر هو وجهة ساحرة لن تتردد في سحركم بالتأكيد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1447
            ["id" => "efb0ba61-f918-4f6e-8acb-87a33d822022", "translation" => "The Oued Harbil beach is a serene expanse of golden sand stretching for over a kilometer along the coast. Surrounded by a picturesque landscape, it is bordered by agricultural fields, primarily greenhouses, and maquis vegetation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2c4e5fa9-9d27-44e5-b73a-7a841911db99", "translation" => "La plage d'Oued Harbil est une étendue sereine de sable doré s'étalant sur plus d'un kilomètre le long de la côte. Cernée par un paysage pittoresque, elle est entourée de terrains agricoles, principalement des serres, et d'une végétation de maquis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3e7c3437-42a0-4ed2-866e-f6aca2f122fb", "translation" => "شاطئ واد حربيل هو مساحة هادئة من الرمال الذهبية تمتد لأكثر من كيلومتر على طول الساحل. محاطة بمناظر خلابة، وتحيط بها حقول زراعية، بشكل رئيسي من الدفيئات الزراعية، ونباتات الغابات الكثيفة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1448
            ["id" => "ab4999e7-c304-4bf8-8e8a-5150d25224d5", "translation" => "Whether you're seeking relaxation, adventure, or contemplation, the Damous beach has it all to charm you. Enjoy this spectacular coastal stretch, whether you come alone, with family, or with friends. This beach promises you unforgettable moments by the water.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fb4324e2-67fa-4939-baff-f76b969c4897", "translation" => "Que vous soyez en quête de détente, d'aventure ou de contemplation, la plage de Damous a tout pour vous séduire. Profitez de cette étendue côtière spectaculaire, que vous veniez seul, en famille ou entre amis. Cette plage vous promet des moments inoubliables au bord de l'eau.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d2d70ea6-2265-4c10-aade-98fb9a099896", "translation" => "سواء كنتم تبحثون عن الاسترخاء، أو المغامرة، أو التأمل، فإن شاطئ الداموس يحمل كل ما يلزم لجذبكم. استمتعوا بمدى الساحل المذهل هذا، سواء كنتم تأتون وحدكم، أو مع العائلة، أو مع الأصدقاء. هذا الشاطئ يعدكم بلحظات لا تُنسى على ضفاف الماء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1449
            ["id" => "ef7a2819-94e7-4901-b8c2-555a64f9a0b5", "translation" => "Whether you're looking for a place to relax, take a stroll, or simply appreciate the natural beauty of the area, the Hadjout square is an ideal place where tranquility, friendliness, and greenery come together to offer a pleasant experience to all who visit.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "470bf15a-1552-4afb-9910-58b650908a10", "translation" => "Que vous recherchiez un endroit pour vous détendre, vous promener ou simplement apprécier la beauté naturelle de la région, le Square Hadjout est un lieu idéal où la tranquillité, la convivialité et la verdure se rencontrent pour offrir une expérience agréable à tous ceux qui le visitent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a314e743-5525-452d-bdce-f05957407696", "translation" => "سواء كنتم تبحثون عن مكان للاسترخاء، أو النزهة، أو مجرد التمتع بجمال الطبيعة في المنطقة، فإن ساحة حجوط هي مكان مثالي حيث تلتقي الهدوء والودية والخضرة لتقديم تجربة ممتعة لجميع الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1450
            ["id" => "86b46999-eb48-42d6-be81-c94893d547dc", "translation" => "The Chabet Ilelouine aqueduct is a remarkable relic of Roman engineering dating back to the reign of Juba II (25 BC - 23 AD). Originally, it extended for at least 45 kilometers, making it the longest aqueduct in Africa at the time. However, unstable soils regularly damaged the structure, requiring engineers to revise its course.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "05fd3549-e462-461b-b681-2c07c62dada6", "translation" => "L'aqueduc de Chabet Ilelouine est un remarquable vestige de l'ingénierie romaine datant du règne de Juba II (25 av. J-C - 23 ap. J-C). À son origine, il s'étendait sur au moins 45 km, faisant de lui le plus long aqueduc d'Afrique à l'époque. Cependant, les sols instables ont régulièrement endommagé la structure, obligeant les ingénieurs à revoir son tracé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e06f1c01-739f-40f4-bb86-85244ffab513", "translation" => "قناة شعبة إللوين هي بقايا ملحوظة للهندسة الرومانية تعود إلى عهد يوبا الثاني (25 قبل الميلاد - 23 ميلادي). في الأصل، امتدت لمسافة تزيد عن 45 كيلومترًا على الأقل، مما جعلها أطول قناة في إفريقيا في ذلك الوقت. ومع ذلك، كانت الترب الغير مستقرة تلحق بالضرر بالهيكل بانتظام، مما أجبر المهندسين على مراجعة مسارها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1451
            ["id" => "a8b99886-378d-45d7-a492-e365a668ef4f", "translation" => "Tipaza Equestrian is an enchanting place that offers a memorable equestrian experience. Upon your arrival, you will be warmly welcomed by a professional and friendly team, ready to teach you the basics of horse riding. You will however need to reserve your place on their WhatsApp, Instagram or Messenger.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "60bc57e7-5bb3-4b31-bf3b-19af7307dff1", "translation" => "Tipaza Equestrian est un lieu enchanteur qui offre une expérience équestre mémorable. Dès votre arrivée, vous serez chaleureusement accueilli par une équipe professionnelle et amicale, prête à vous enseigner les bases de l'équitation. Vous devrez néanmoins réserver votre place sur leur WhatsApp, Instagram ou Messenger.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c2b83eb9-8e4a-4b2e-a042-db93ec4e62ef", "translation" => "تيبازة للفروسية هي مكان ساحر يقدم تجربة ركوب الخيل التي لا تُنسى. فور وصولك، ستُرحب بك فريق محترف وودود، مستعد لتعليمك أساسيات ركوب الخيل. ومع ذلك، سيتعين عليك حجز مكانك على تطبيق WhatsApp أو Instagram أو Messenger الخاص بهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1452
            ["id" => "819a00b6-c893-4ddc-9692-0e757358963b", "translation" => "Kolea's central square is a vibrant and iconic place in the heart of the city. Surrounded by historical and modern buildings, it is considered the focal point of the region's social life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f93d35ee-6cf8-4849-9f65-f692b05615f6", "translation" => "La place centrale de Koléa est un lieu animé et emblématique au cœur de la ville. Entourée d'édifices historiques et modernes, elle est considérée comme le point névralgique de la vie sociale de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2b77e410-dbcd-4c1e-9553-0a51a97d8637", "translation" => "الساحة المركزية في القليعة هي مكان حيوي ورمزي في قلب المدينة. محاطة بالمباني التاريخية والحديثة، وتُعتبر نقطة تجمع حيوية للحياة الاجتماعية في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1453
            ["id" => "923afd04-bc55-47aa-ba18-b8b2e08f828f", "translation" => "The Sidi el Djilali beach is an ideal destination for those looking to recharge in a peaceful and preserved environment. Whether it's camping, fishing, or outdoor activities, visitors will find a peaceful and rejuvenating experience by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d62432a2-fe18-4626-bee2-34491a0ec2a3", "translation" => "La plage de Sidi el Djilali est une destination idéale pour ceux qui cherchent à se ressourcer au milieu d'un environnement calme et préservé. Entre camping, pêche et activités en plein air, les visiteurs trouveront ici une expérience paisible et ressourçante au bord de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "34d7a944-3b35-44d9-9862-95e5114c010c", "translation" => "شاطئ سيدي الجيلالي هو وجهة مثالية لأولئك الذين يبحثون عن الاسترخاء في بيئة هادئة ومحمية. سواء كان الأمر يتعلق بالتخييم، أو الصيد، أو الأنشطة في الهواء الطلق، سيجد الزوار هنا تجربة هادئة ومجددة على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1454
            ["id" => "cc55dd3f-d098-4f56-a470-2151aa7300ed", "translation" => "The Tizgha beach invites you to a haven of peace and serenity, perfect for a family getaway. Its beautiful clear and clean waters will provide you with a refreshing swimming experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b3ee027b-d4d4-4dc1-b80b-73ff014c6b4c", "translation" => "La plage de Tizgha vous invite à un havre de calme et de sérénité, idéal pour une escapade en famille. Ses magnifiques eaux claires et propres vous offriront une expérience de baignade rafraîchissante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e95370ca-5f3e-45bc-88d8-93046018ae47", "translation" => "شاطئ تيغزة يدعوكم إلى ملاذ من الهدوء والسكينة، مثالي للهروب مع العائلة. مياهه الجميلة الصافية والنظيفة ستقدم لكم تجربة منعشة للسباحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1455
            ["id" => "3e31918b-5df5-4b66-8827-ea587a2091da", "translation" => "The Beni Haoua beach is perfect for outdoor activities, whether it's swimming in the refreshing waters, strolling along the shore, or simply relaxing under the bright sun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9a893fa3-bc2f-497a-9b6c-965d5c07c336", "translation" => "La plage de Beni Haoua est parfaite pour des activités de plein air, que ce soit pour se baigner dans les eaux rafraîchissantes, se promener le long du rivage ou simplement se détendre sous le soleil éclatant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4a34a4cf-d2dd-4a0b-a69e-f4f4df5ea725", "translation" => "شاطئ بني حواء مثالي للأنشطة في الهواء الطلق، سواء كان الأمر يتعلق بالسباحة في المياه المنعشة أو الجلوس على طول الشاطئ أو ببساطة الاسترخاء تحت أشعة الشمس الساطعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1456
            ["id" => "64070959-269c-4b2d-ab06-5661033f68f3", "translation" => "The port of Beni Haoua offers a lively and authentic maritime atmosphere, where visitors can immerse themselves in the world of fishermen and connect with the beauty of the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fa8cc3fc-3660-44f6-a13d-92e499e23165", "translation" => "Le port de Béni Haoua offre une atmosphère maritime vivante et authentique, où les visiteurs peuvent se plonger dans l'univers des pêcheurs et se connecter avec la beauté de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2c57bb76-d9e6-4a71-995e-860c5e731bbe", "translation" => "ميناء بني حواء يقدم أجواء بحرية حية وأصيلة، حيث يمكن للزوار أن يغمروا أنفسهم في عالم الصيادين ويتواصلوا مع جمال البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1457
            ["id" => "34b95b74-84ab-4244-96da-c69a5e8f07c8", "translation" => "The Rmilia beach is a hidden paradise, secluded and difficult to access. To reach it, one can take a boat from the central beach of Beni Haoua. This remote beach offers a unique experience with an uncrowded shoreline, perfect for camping.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "07c87a6c-67c7-460d-bbfa-d9d010d4aa27", "translation" => "La plage de Rmilia est un véritable paradis caché, situé à l'écart et difficile d'accès. Pour y parvenir, on peut emprunter un bateau depuis la plage centrale de Beni Haoua. Cette plage reculée offre une expérience unique, avec une rive peu fréquentée, idéale pour le camping.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5e1a8c78-fd59-4687-b228-7197f1096535", "translation" => "شاطئ الرميلية هو جنة مخفية حقيقية، نائية وصعبة الوصول. للوصول إليه، يمكن للزوار أن يأخذوا قاربًا من الشاطئ المركزي لبني حواء. يوفر هذا الشاطئ البعيد تجربة فريدة مع شاطئ قليل الازدحام، مثالي للتخييم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1458
            ["id" => "3a4ef892-ff68-4b26-8ae5-cc8c153809ca", "translation" => "The Tombourouf blockhouse is a historical relic in the city of Kolea. At one point, the Turks ordered the construction of four blockhouses in the region to monitor the Mitidja plain and its surroundings. These military structures likely served defensive and strategic purposes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "197a2007-dce3-4fb2-a24c-42dc518111ee", "translation" => "Le blockhaus de Tombourouf est un vestige historique de la ville de Koléa. À une époque, les Turcs ont ordonné la construction de quatre blockhaus dans la région afin de surveiller la plaine de la Mitidja et ses environs. Ces structures militaires servaient probablement à des fins défensives et stratégiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "50acd6d8-4097-4703-8fbe-e0427288b705", "translation" => "حصن تمبوروف هي آثار تاريخية في مدينة القليعة. في وقت ما، أمر الأتراك ببناء أربع حصون في المنطقة لمراقبة سهل المتيجة ومحيطها. هذه الهياكل العسكرية ربما كانت تستخدم لأغراض دفاعية واستراتيجية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1459
            ["id" => "046f89d9-83b9-4204-8d41-d01dcc1f6dd3", "translation" => "The dam is an ideal place for family or friends' picnics, with its extensive green areas conducive to relaxation and socializing. Photography enthusiasts will be delighted by the opportunities to capture breathtaking landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "194f8275-86f2-4b70-aa47-4ea8818ce328", "translation" => "Le barrage est un lieu idéal pour les pique-niques en famille ou entre amis, avec ses vastes aires de verdure propices à la détente et aux moments de convivialité. Les amateurs de photographie seront ravis par les opportunités de capturer des paysages époustouflants.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "23e4d358-30e3-4535-adc1-2b7377da992e", "translation" => "السد هو مكان مثالي للنزهات العائلية أو مع الأصدقاء، مع مساحاته الخضراء الواسعة التي تشجع على الاسترخاء والاجتماع. سيكون عشاق التصوير مسرورين بفرص التقاط مناظر طبيعية خلابة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1460
            ["id" => "d9b6e912-af1b-4f10-b9cb-ff61586e1dd1", "translation" => "Come and discover the Doumia beach where you will be charmed by this perfect combination of nature, relaxation, and entertainment. It's the ideal place to create unforgettable memories and experience moments of joy with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e1fcf77c-43ba-402a-a334-8d4d71d1021d", "translation" => "Venez découvrir la plage de Doumia où vous serez charmé par cette combinaison parfaite de nature, de détente et de divertissement. C'est l'endroit idéal pour créer des souvenirs inoubliables et vivre des moments de bonheur en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a5e777bc-6838-4ff4-bf00-1b1157efb96c", "translation" => "تعال واكتشف شاطئ دومية حيث ستُسحر بتلك الجمعية المثالية بين الطبيعة والاسترخاء والتسلية. إنه المكان المثالي لخلق ذكريات لا تُنسى وعيش لحظات من السعادة مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1461
            ["id" => "416f61a0-77ed-4f28-bef8-cc3071d1979c", "translation" => "The Oued Goussine beach is a true paradise for vacationers looking for relaxation and entertainment. Located between the charming coastal towns of Tenes and Beni Haoua, this beach is renowned for being one of the most beautiful and attractive in the Chlef region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "af071aa1-1f50-4479-b186-b233eb346e26", "translation" => "La plage d'Oued Goussine est un véritable paradis pour les vacanciers en quête de détente et de divertissement. Située entre les charmantes villes côtières de Ténès et de Béni Haoua, cette plage est réputée pour être l'une des plus belles et des plus attrayantes de la région de Chlef.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2923da9d-9e76-467b-9ffb-c63d41bdd6c4", "translation" => "شاطئ واد ڨوسين هو جنة حقيقية للمصطافين الباحثين عن الاسترخاء والترفيه. يقع بين المدن الساحلية الجميلة تنس و بني حواء، وهذا الشاطئ مشهور بأنه واحد من أجمل وأكثرها جاذبية في منطقة الشلف.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1462
            ["id" => "b46f966f-0d23-4604-ac63-d0adea09403b", "translation" => "If you're looking for an outdoor getaway, nestled between the sea and the forest, the Boucheral beach is an ideal choice. Come explore this rocky paradise where natural beauty takes your breath away, and the magic of the forest awaits for a memorable experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b8e5bef7-edea-4bd2-89ea-33d15cea864f", "translation" => "Si vous recherchez une escapade en plein air, entre mer et forêt, la plage de Boucheral est un choix idéal. Venez explorer ce coin de paradis rocheux, où la beauté naturelle est à couper le souffle et où la magie de la forêt vous attend pour une expérience mémorable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b0516168-e80a-4474-879c-65641eea558d", "translation" => "إذا كنت تبحث عن رحلة في الهواء الطلق، ما بين البحر والغابة، فإن شاطئ بوشغال هو اختيار مثالي. تعال استكشف هذا الجنة الصخرية حيث الجمال الطبيعي يأخذ أنفاسك، وسحر الغابة ينتظرك لتجربة لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1463
            ["id" => "a7071a36-69d6-4935-ab92-4e80939c4327", "translation" => "The Traghnia waterfalls are a true natural gem, a haven of peace where visitors can connect with the beauty of creation and recharge in a paradise-like setting. For those who love contemplation and tranquility, this destination is a must-visit.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "13fcc069-b629-4b44-9b33-54cacb7a1642", "translation" => "Les cascades de Traghnia sont un véritable joyau de la nature, un havre de paix où les visiteurs peuvent se connecter avec la beauté de la création et se ressourcer dans un cadre paradisiaque. Pour les amoureux de la contemplation et de la tranquillité, cette destination est un incontournable à découvrir.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8933fb13-06e8-4212-a766-4753d859a09d", "translation" => "شلالات تراغنية هي جوهرة طبيعية حقيقية، مأوى للسلام حيث يمكن للزوار أن يتواصلوا مع جمال الخلق. بالنسبة لأولئك الذين يحبون التأمل والهدوء، هذه الوجهة لا غنى عنها لاستكشافها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1464
            ["id" => "b26939f6-e82b-4bd6-9046-a49ddedeebd1", "translation" => "Whether it's a solo getaway or a family outing, the Traghnia beach offers a memorable experience in a preserved natural setting, where the harmony between the sea and the surrounding nature creates a soothing and magical atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d94a8c18-91d3-47b4-85f3-6422578707cd", "translation" => "Que ce soit pour une escapade en solitaire ou une sortie en famille, la plage de Traghnia offre une expérience mémorable dans un cadre naturel préservé, où l'harmonie entre la mer et la nature environnante crée une atmosphère apaisante et magique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "91d68393-9749-4a04-961e-17462eb40376", "translation" => "سواء كنت تبحث عن رحلة منفردة أو نزهة عائلية، فإن شاطئ تراغنية يقدم تجربة لا تُنسى في إطار طبيعي محافظ، حيث تخلق الانسجام بين البحر والطبيعة المحيطة أجواء مهدئة وساحرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1465
            ["id" => "e1c47b1e-2a74-426f-b588-e931c5e4a2f1", "translation" => "The big beach of Tenes is a special place that charms with its wild and authentic appearance. For fishing enthusiasts and those who appreciate preserved coastal landscapes, this beach offers a unique experience in the heart of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bbfa08e1-ccce-4079-ba23-576fb3f79e95", "translation" => "La grande plage de Ténès est un endroit particulier qui charme par son aspect sauvage et authentique. Pour les amateurs de pêche et ceux qui apprécient les paysages côtiers préservés, cette plage offre une expérience unique au cœur de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f966c676-7ccd-4035-a3e5-e9e65c8fd344", "translation" => "الشاطئ الكبير في تنس هو مكان خاص يفتن بمظهره البري والأصيل. بالنسبة لهواة الصيد وأولئك الذين يقدرون المناظر الساحرة على الساحل، يقدم هذا الشاطئ تجربة فريدة في قلب الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1466
            ["id" => "3027e0a0-3e0e-4c89-9280-4e6bce9f97b6", "translation" => "The Oued Guessab beach is a place where it's advisable not to swim due to potential water pollution. However, it can offer a pleasant atmosphere for strolling along the shore, enjoying the sea breeze, and contemplating the natural beauty of the area.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c48a5df4-cf2a-43ab-954f-e31fa303207a", "translation" => "La plage d’Oued Guessab est un endroit où il est préférable de ne pas se baigner en raison de la possible pollution des eaux. Cependant, elle peut offrir une atmosphère agréable pour se promener le long du rivage, profiter de la brise marine et contempler la beauté naturelle des lieux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0d403506-ef0d-44f7-8d65-e8ca11fe2aa8", "translation" => "شاطئ واد القصب هو مكان حيث من الأفضل عدم السباحة بسبب احتمال تلوث المياه. ومع ذلك، يمكن أن يوفر جوًا لطيفًا للتجول على طول الشاطئ، والاستمتاع بنسمات البحر، والتأمل في جمال الطبيعة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1467
            ["id" => "285933f6-2d72-4ef3-bda8-2bbbd634d816", "translation" => "The Ain el Kadi beach is a charming and family-friendly small beach, offering a pleasant and relaxed atmosphere. It's an ideal place to spend time with family.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f5677d9c-eba6-4e47-bf47-293eeee38ecc", "translation" => "La plage d’Ain el Kadi est une petite plage charmante et familiale, offrant une ambiance agréable et décontractée. C'est un lieu idéal pour passer du temps en famille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f3c53bbe-8541-405a-94d4-7ae7b89d9f23", "translation" => "شاطئ عين القاضي هو شاطئ صغير ساحر وصديق للعائلة، يوفر أجواء لطيفة ومريحة. إنه مكان مثالي لقضاء وقت ممتع مع العائلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1468
            ["id" => "0acae6f5-6d5b-4433-a341-80347d6b6446", "translation" => "The Tenes port is a dynamic and authentic place where maritime activity blends harmoniously with local life. It's a place to visit to experience the unique atmosphere of the Algerian coast and admire the beauty of the Mediterranean Sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "574a9c11-81cb-4bdb-9c45-0af48eb66e5a", "translation" => "Le port de Ténès est un lieu dynamique et authentique, où l'activité maritime se mêle harmonieusement à la vie locale. C'est un endroit à visiter pour découvrir l'ambiance unique de la côte algérienne et admirer la beauté de la mer Méditerranée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "283f3125-15e7-4ee1-81e2-845553bd195b", "translation" => "ميناء تنس هو مكان حيوي وأصيل، حيث تمتزج النشاطات البحرية بانسجام مع الحياة المحلية. إنه مكان يجب زيارته لاكتشاف الجو الفريد للساحل الجزائري والتمتع بجمال البحر الأبيض المتوسط.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1469
            ["id" => "f75d2b7f-a20c-4f95-bd71-68b13fe66e9a", "translation" => "The Mainis beach provides a peaceful setting to relax and enjoy the sea. It's a place where families can gather, share enjoyable moments, and appreciate the unique beauty of this location.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4533af49-b365-4339-897a-7bfa6e500b00", "translation" => "La plage de Mainis offre un cadre paisible pour se détendre et profiter de la mer. C'est un endroit où les familles peuvent se réunir, partager des moments agréables et apprécier la beauté atypique de ce lieu.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7a365eb5-bf8a-4bfa-84ca-0fee3953b3f2", "translation" => "شاطئ ماينيس يوفر بيئة هادئة للاسترخاء والاستمتاع بالبحر. إنه مكان يمكن للعائلات الاجتماع فيه ومشاركة لحظات ممتعة و تقدير جمال هذا المكان الفريد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1470
            ["id" => "0c0a327f-c68c-4571-9d05-9d99c9c44368", "translation" => "Whether it's a family getaway or simply a moment of tranquility on your own, the Dramla beach is a must-visit for those looking to connect with the beauty of nature and the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5a1a8ccf-e39f-4c20-8188-9fa5fae11a92", "translation" => "Que ce soit pour une escapade en famille ou simplement pour profiter d'un moment de tranquillité en solo, la plage de Dramla est un endroit à ne pas manquer pour ceux qui cherchent à se connecter avec la beauté de la nature et de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b5f5cd11-7ff0-481e-a429-6b1e5bbeba69", "translation" => "سواء كنت تبحث عن إجازة عائلية أم مجرد لحظة من الهدوء بمفردك، شاطئ الدراملة هو مكان يجب عليك زيارته لمن يبحثون عن التواصل مع جمال الطبيعة والبحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1471
            ["id" => "dd50fceb-2a92-42e4-afa8-6cb169ddb251", "translation" => "The Oued el Melh beach is appreciated for its peaceful and relaxing atmosphere. It's an ideal place to unwind, sunbathe, and enjoy the gentle sound of the waves.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9fd49e26-866c-4f1c-a916-233d31d09851", "translation" => "La plage d’Oued el Melh est appréciée pour son atmosphère paisible et relaxante. C'est un endroit idéal pour se détendre, bronzer au soleil et profiter du doux murmure des vagues.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "debe14d5-14e5-45fa-8f84-0a029bf96aba", "translation" => "شاطئ واد الملح يُقدر لأجواءه السلمية والمريحة. إنه مكان مثالي للاسترخاء والاستلقاء تحت أشعة الشمس والاستمتاع بلطف موج البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1472
            ["id" => "22121563-cc5a-448f-985a-b10efdee07d2", "translation" => "The el Ghatra beach is a haven of peace, offering a calm and family-friendly atmosphere. It's a place where you can relax and enjoy the sun in serenity.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "25d813f7-9409-4010-bd42-5f97e11a108a", "translation" => "La plage d'el Ghatra est un havre de paix, offrant une atmosphère calme et familiale. C'est un endroit où l'on peut se détendre et profiter du soleil en toute sérénité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "62fa91ed-78b5-45a2-a846-63167fe643dd", "translation" => "الشاطئ الغترة هو ملاذ للسلام، حيث يقدم أجواءً هادئة وصديقة للأسرة. إنه المكان الذي يمكنك فيه الاسترخاء والتمتع بالشمس بسكينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1473
            ["id" => "47855e37-62f0-4eb3-9ebe-3717eec13ac1", "translation" => "The Sidi Abderrahman port is a gem on the western coast of the Chelif coast, offering a unique combination of tourism and fishing. The latter is attracting more and more visitors who are amazed by its picturesque setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "25b88950-06c8-4ed7-a011-7bb41b3fb3fa", "translation" => "Le port de Sidi Abderrahman est une perle sur le littoral ouest de la côte chélifienne, offrant une combinaison unique entre tourisme et pêche. Ce dernier attire de plus en plus de visiteurs émerveillés par son cadre pittoresque.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "df7bc9d5-c0bc-403b-8e62-dcebfe1c4985", "translation" => "ميناء سيدي عبد الرحمان هو جوهرة على الساحل الغربي لساحل الشلف، ويقدم مزيجًا فريدًا بين السياحة وصيد الأسماك. يجذب هذا الأخير المزيد والمزيد من الزوار الذين يعجبون بمحيطه الخلاب.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1474
            ["id" => "9f7b980d-7c14-49ff-8210-a86048c5e810", "translation" => "The Parchacho beach is a true gem nestled between two large rocks, making it a place of exceptional beauty. However, access is not easy, so it is not recommended for families with young children.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7f4d0a3c-ee6d-4c64-b6a7-3dc9fb146cc9", "translation" => "La plage Parchacho est un véritable joyau niché entre deux grandes roches, ce qui en fait un lieu d'une beauté exceptionnelle. Cependant, l'accès n'y est pas facile, il n'est donc pas recommandé pour les familles avec des enfants en bas âge.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e3eddfc6-9683-4627-bed2-1bfe702ca156", "translation" => "شاطئ برتشتشو هو جوهرة حقيقية مختبئة بين صخرتين كبيرتين، مما يجعله مكانًا ذا جمال استثنائي. ومع ذلك، الوصول إليه ليس سهلاً، لذا لا يُنصح به للعائلات ذات الأطفال الصغار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1475
            ["id" => "f7e81745-1094-4dcd-8378-df2c5cc00af5", "translation" => "The Oued Zeboudj beach is a true natural paradise that absolutely deserves to be discovered. It consists of two distinct beaches separated by rocks. The first beach is covered with beautiful pebbles, with clear water and fresh air. The second beach, accessible by wading through the first one, is sandy, natural, and surrounded by rocks that blend with the sea, giving it a greenish appearance due to algae and other marine plants. This uniqueness makes it special, as there are no big waves, offering calm and soothing waters.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f4d2051d-9d7f-4938-b836-62ca69803b0b", "translation" => "La plage d’Oued Zeboudj est un véritable paradis naturel qui mérite absolument d'être découvert. Elle est composée de deux plages distinctes séparées par des rochers. La première plage est recouverte de magnifiques galets, avec une eau claire et un air pur. La deuxième plage, accessible en passant par la première et en se mouillant les jambes, est sablonneuse, naturelle et entourée de rochers qui se fondent avec la mer, donnant une apparence verte due aux algues et autres plantes marines. Cette particularité la rend unique, car il n'y a pas de grandes vagues, offrant ainsi une eau calme et apaisante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "aea6a70f-f028-4d29-9319-c5cf335b2317", "translation" => "شاطئ واد الزبوج هو فعلاً جنة طبيعية حقيقية تستحق بالتأكيد أن تُكتشف. يتكون من شاطئين متميزين مفصولين بالصخور. الشاطئ الأول مغطى بحصى جميلة، مع مياه واضحة وهواء نقي. الشاطئ الثاني، الذي يمكن الوصول إليه عن طريق العبور عبر الشاطئ الأول وتبليل الساقين، يحتوي على رمال وطين طبيعي ومحاط بصخور تمتزج مع البحر، مما يمنحه مظهرًا أخضر بسبب الطحالب والنباتات البحرية الأخرى. هذه الخصوصية تجعلها فريدة من نوعها، حيث لا توجد أمواج كبيرة، مما يقدم مياهًا هادئة ومريحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1476
            ["id" => "f1d21daf-40b5-4397-a52d-0605a5798154", "translation" => "The Date beach is one of the most beautiful beaches along our coast, a true paradise with turquoise waters and breathtaking views. The beach is especially clean and well-maintained, making it a pleasant place for families and young children.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a0d6a7e7-abd5-44ef-bc05-cde499e4c035", "translation" => "La plage Dattier est l'une des plus belles plages le long de nos côtes, un véritable paradis avec une mer turquoise et une vue à couper le souffle. La plage est particulièrement propre et bien entretenue, ce qui en fait un lieu agréable pour les familles et les jeunes enfants.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "31a5d989-f654-4193-8178-1239803a2638", "translation" => "شاطئ داتي هو واحد من أجمل الشواطئ على طول سواحلنا، فهو فعلاً جنة بمياهه الزرقاء الزاهية ومناظره الرائعة. الشاطئ نظيف بشكل خاص ومُحافظ عليه بشكل جيد، مما يجعله مكانًا لطيفًا للعائلات والأطفال الصغار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1477
            ["id" => "55528dec-3730-48a9-8e48-8ba113abcd04", "translation" => "The cave beach is a wonderful, calm, and friendly beach that offers stunning landscapes. However, its access can be challenging as there is no flat road to reach it. Visitors must walk on rugged and steep trails, making it a destination for adventure enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e41d4786-4a65-4974-b094-a48a6c44d1a5", "translation" => "La plage de La Cave est une merveilleuse plage calme et conviviale qui offre des paysages époustouflants. Cependant, son accès peut être un défi, car il n'y a pas de route plate pour y arriver. Les visiteurs doivent marcher sur des sentiers accidentés et escarpés, ce qui en fait une destination pour les amateurs d'aventures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "18fefbdd-4ba4-4d09-a7ea-25745d025336", "translation" => "شاطئ لاكاف هو شاطئ رائع هادئ ومضياف يقدم مناظر خلابة. ومع ذلك، يمكن أن يكون الوصول إليه تحديًا، حيث لا يوجد طريق مستوي للوصول إليه. يجب على الزوار المشي على مسارات جبلية ووعرة، مما يجعله وجهة لعشاق المغامرات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1478
            ["id" => "d5f3b3d8-2e1b-4b6e-8b07-01855897ce4b", "translation" => "The Taghzoult beach provides an idyllic setting to enjoy the sea and the sun, with stunning views of the coast. It's a place to discover and appreciate for its natural beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7ef6bfff-a658-46d8-afe5-697b969b12f1", "translation" => "La plage Taghzoult offre un cadre idyllique pour profiter de la mer et du soleil, avec une vue imprenable sur la côte. C'est un lieu à découvrir et à apprécier pour sa beauté naturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5eeebc0b-13ad-4aee-a13a-ac3d51e9c564", "translation" => "شاطئ تاغزولت يقدم إطارًا جميلاً للاستمتاع بالبحر والشمس، مع إطلالات رائعة على الساحل. إنه مكان يجب اكتشافه وتقديره من أجل جماله الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1479
            ["id" => "cd5e405f-e238-480d-86ac-2f8a2f73fff2", "translation" => "The open air theater in Tenes is an enchanting place infused with an artistic atmosphere. Although the lack of performances may be felt, this open space retains its charm.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "83114b72-f7ba-4eff-9797-ecb394f4a74f", "translation" => "Le théâtre en plein air de Ténès est un lieu enchanteur imprégné d'une atmosphère artistique. Même si le manque de représentations peut se faire ressentir, cet espace ouvert reste empreint de charme.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b371b001-efa3-47b3-ae7d-a018c8c3ce54", "translation" => "مسرح الهواء الطلق في تنس هو مكان ساحر يتميز بأجواء فنية. على الرغم من أن نقص العروض المسرحية قد يكون ملحوظًا، إلا أن هذا المساحة المفتوحة تحتفظ بسحرها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1480
            ["id" => "bb1d3165-f4ba-4bfb-90a6-9c9cf5092063", "translation" => "The Babor beach is a must-visit destination for sea and nature enthusiasts, offering an enchanting and relaxing setting to enjoy pleasant moments by the seaside.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cba273a1-1baf-4350-b325-4bffc1e28c56", "translation" => "La plage Babor est une destination incontournable pour les amoureux de la mer et de la nature, offrant un cadre enchanteur et relaxant pour passer des moments agréables en bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ef539272-7669-4e0e-9abb-c2460b083295", "translation" => "شاطئ بابور هو وجهة لا غنى عنها لعشاق البحر والطبيعة، حيث يوفر إعدادًا ساحرًا ومسترخيًا للاستمتاع بأوقات ممتعة على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1481
            ["id" => "78227cd3-fb00-4523-ba41-c13fdce67351", "translation" => "The hajret ben youcef beach is a lovely rocky beach, partly covered in pebbles with some sandy areas. It is renowned as an excellent family destination, with easy access from the national road.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8d2dd25d-7f63-4cbf-a4cd-1772446867df", "translation" => "La plage de hajret ben youcef est une charmante plage rocheuse, partiellement couverte de cailloux avec quelques zones de sable. Elle est réputée pour être une destination familiale par excellence, offrant un accès facile depuis la route nationale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "64708adc-11a7-44ee-a1ad-b02d9168e2ec", "translation" => "شاطئ حجرة بن يوسف هو شاطئ جميل ذو صخور جزئية، مغطى جزئياً بالحصى مع بعض المناطق الرملية. إنه مشهور كوجهة عائلية ممتازة، حيث يوفر سهولة الوصول من الطريق الوطنية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1482
            ["id" => "d68bc0a2-dccc-452c-9cec-187d41b51ac1", "translation" => "The El Guettar beach is a popular family destination. It provides a secure setting where visitors can enjoy the pleasures of the beach in a well-organized environment with peace of mind.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2188617c-ee0d-415c-b31b-a09deb209204", "translation" => "La plage El Guettar est une destination familiale prisée. Elle offre un cadre sécurisé où les visiteurs peuvent profiter en toute quiétude des joies de la plage dans un environnement bien organisé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8a657364-f9d4-47dd-9342-a0a2d729df67", "translation" => "شاطئ القطار هو وجهة شهيرة للعائلات. إنه يوفر بيئة آمنة حيث يمكن للزوار الاستمتاع بمتع الشاطئ براحة في بيئة منظمة بشكل جيد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1483
            ["id" => "59014445-531e-4477-bdd1-cdedfa36b387", "translation" => "The fishing port of El Marsa is a lively and authentic place where you can discover the life of fishermen and savor the delights of the sea while enjoying a pleasant maritime atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "85246ee5-8233-432b-b230-8862a7c4f0d1", "translation" => "Le port de pêche d'El Marsa est un lieu animé et authentique où l'on peut découvrir la vie des pêcheurs et savourer les délices de la mer tout en profitant d'une ambiance maritime agréable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "60dbc4cc-52a7-4742-84c5-53292b46334d", "translation" => "ميناء الصيد في المرسى هو مكان حيوي وأصيل حيث يمكنك اكتشاف حياة الصيادين والتذوق لذائذ البحر بينما تستمتع بأجواء بحرية ممتعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1484
            ["id" => "c62d38a4-5839-4eee-9305-45401a6926fc", "translation" => "The El Marsa West beach stands out with its coastal landscape composed of polished and smooth pebbles, stretching along the shore. This uniqueness gives the beach a distinct charm and offers visitors a different experience from traditional sandy beaches.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8dde6a00-101f-40a7-a985-62937771af50", "translation" => "La plage d’el Marsa Ouest se distingue par son paysage côtier composé de galets polis et lisses, s'étendant le long du rivage. Cette particularité donne à la plage un charme unique et offre aux visiteurs une expérience différente des plages de sable traditionnelles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "63fe86c3-a779-4971-8232-99e720eebf4a", "translation" => "شاطئ المرسى الغربي يتميز بمناظره الساحرة المكونة من الحصى الملساء والمصقولة التي تمتد على طول الشاطئ. هذه الخصوصية تمنح الشاطئ سحرًا فريدًا وتقدم للزوار تجربة مختلفة عن الشواطئ الرملية التقليدية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1485
            ["id" => "17599ab4-b2ae-4373-af84-14a7984c54ce", "translation" => "The El Marsa East beach is an appealing destination for sea lovers, providing a pleasant natural environment and a relaxing atmosphere conducive to leisure and beach activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5fcd7937-9713-4d66-8700-5a09b4e39800", "translation" => "La plage d’el Marsa Est est une destination attrayante pour les amoureux de la mer, offrant un environnement naturel agréable et une atmosphère relaxante propice à la détente et aux loisirs balnéaires.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dfe9a24c-6f0f-4307-8389-fe897f1712b8", "translation" => "شاطئ المرسى الشرقي هو وجهة جاذبة لعشاق البحر، حيث يوفر بيئة طبيعية ساحرة وأجواء مريحة تشجع على الاسترخاء وأنشطة الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1486
            ["id" => "6887e367-3abb-431c-b108-4c3b310472f7", "translation" => "The El Guelta beach is nestled in the heart of a small tourist community, offering all the necessary facilities for a pleasant stay. It includes restaurants, ice cream parlors, and opportunities for traditional fishing. This beach is a true attraction for visitors, including expatriates, who come to enjoy the friendly atmosphere and diverse activities offered.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "297319be-9494-4e2d-9956-1541edc7f974", "translation" => "La plage d’El Guelta est nichée au cœur d'une petite communauté touristique, offrant toutes les installations nécessaires pour un séjour agréable. On y trouve notamment des restaurants, des glaciers et des opportunités de pratiquer la pêche traditionnelle. Cette plage est un véritable pôle d'attraction pour les visiteurs, y compris les expatriés, qui viennent profiter de l'ambiance conviviale et des activités variées proposées.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d60f5d33-9657-4ff0-81ad-7f1849cacb5d", "translation" => "شاطئ القلتة يتوسط مجتمع سياحي صغير، ويقدم جميع المرافق الضرورية لإقامة ممتعة، بما في ذلك المطاعم ومحلات بيع الآيس كريم وفرص لممارسة صيد الأسماك التقليدي. هذا الشاطئ هو جاذب حقيقي للزوار، بما في ذلك الوافدين الأجانب، الذين يأتون للاستمتاع بالجو الودي والأنشطة المتنوعة المقدمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1487
            ["id" => "ff522f9b-45eb-486b-9d19-c9eca0d27ff4", "translation" => "The Messaadia beach is an ideal destination for nature lovers and beach holiday enthusiasts, offering a relaxing atmosphere and enchanting landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f66db623-bcaf-466c-813e-7cb3f64181d6", "translation" => "La plage Messaadia est une destination idéale pour les amoureux de la nature et les adeptes de vacances balnéaires, offrant une atmosphère relaxante et des paysages enchanteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6caabcf3-c0cc-4530-954b-571d4a88123a", "translation" => "شاطئ مساعدية هو وجهة مثالية لعشاق الطبيعة وعشاق عطلات الشاطئ، حيث يقدم أجواءً مريحة ومناظر خلابة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1488
            ["id" => "93ed67f2-8746-48d5-acea-4ca4ddd0d7ea", "translation" => "The main features of the Dechria beach are its fine golden sand and shallow, unpolluted waters. Furthermore, it has the advantage of being distant from urban centers, attracting vacationers seeking a peaceful natural setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "923658da-3d1f-45b1-82de-46fbdfc531d1", "translation" => "Les principales caractéristiques de la plage de Dechria sont son sable fin doré et ses eaux peu profondes et non polluées. De plus, elle a l'avantage d'être éloignée des centres urbains, ce qui attire tous les vacanciers à la recherche d'un cadre naturel paisible.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "daf8d065-921e-4e66-b4f0-72f5e50d784f", "translation" => "السمات الرئيسية لشاطئ دشرية هي رماله الرقيقة الذهبية ومياهه الضحلة وغير الملوثة. بالإضافة إلى ذلك، لها ميزة أنها بعيدة عن المراكز الحضرية، مما يجذب جميع العطلاء الباحثين عن بيئة طبيعية هادئة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1489
            ["id" => "bc72b826-bafc-4e54-9416-cc3548adf63e", "translation" => "The Tamist beach is a pleasant place, offering all the necessary amenities for an enjoyable time with family or friends, in a secure and relaxing environment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8224724b-a7e7-4696-bf1a-c68550acef92", "translation" => "La plage de Tamist est un lieu agréable, offrant toutes les commodités nécessaires pour passer un moment plaisant en famille ou entre amis, dans un cadre sécurisé et propice à la détente.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "faaa618e-52c2-4a51-bc4d-2deb1ea9489b", "translation" => "شاطئ تاميست هو مكان لطيف، يقدم جميع وسائل الراحة الضرورية لقضاء وقت ممتع مع العائلة أو الأصدقاء، في بيئة آمنة ومريحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1490
            ["id" => "c6db6f56-bee2-432a-a4ac-42c3b666b8f0", "translation" => "This place is carefully maintained and well-renovated, providing a clean and pleasant environment for visitors. Furthermore, it is easily accessible by public transport due to the presence of a nearby bus station.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b4b403c6-48e4-4fc6-8542-c373b354f527", "translation" => "Cette place est soigneusement entretenue et bien rénovée, offrant un environnement propre et agréable pour les visiteurs. De plus, elle est facilement accessible en transport en commun grâce à la présence d'une gare routière à proximité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "60ebf2e6-a2a8-48b7-baa4-9bd553d83773", "translation" => "هذا المكان يُعتنى به بعناية ويتم تجديده بشكل جيد، مما يوفر بيئة نظيفة وممتعة للزوار. بالإضافة إلى ذلك، يمكن الوصول إليه بسهولة عبر وسائل النقل العامة بفضل وجود محطة حافلات قريبة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1491
            ["id" => "4377af15-c8ed-40bd-bba7-04e0e2005b64", "translation" => "This garden is an essential place for preserving the beauty and charm of Chlef. It provides a well-maintained green space, conducive to relaxation and tranquility in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4e5aa6ca-7333-4a3f-926d-a3ba7f33e226", "translation" => "Ce jardin est un lieu essentiel pour la préservation de la beauté et du charme de Chlef. Il offre un espace vert bien entretenu, propice à la détente et à la tranquillité au cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5f8e188d-80c7-4fef-b720-dd66a83bae79", "translation" => "هذه الحديقة مكان أساسي للحفاظ على جمال وسحر الشلف. إنها توفر مساحة خضراء محافظ عليها بشكل جيد، تُشجع على الاسترخاء والسكينة في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1492
            ["id" => "a2ec26f3-5ad2-419a-b64c-d43ae098044e", "translation" => "This garden provides a green refuge where residents and visitors can escape the hustle and bustle of urban life and rejuvenate in a soothing natural setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fd12c661-b367-4bbc-936b-68b45e62118d", "translation" => "Ce jardin offre un refuge verdoyant où les résidents et les visiteurs peuvent échapper à l'agitation de la vie urbaine et se ressourcer dans un cadre naturel apaisant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e7c9478a-40c5-4f5f-aeaf-19375873c994", "translation" => "هذه الحديقة توفر مأوى أخضر حيث يمكن للسكان والزوار الهروب من صخب الحياة الحضرية واستعادة نشاطهم في بيئة طبيعية مهدئة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1493
            ["id" => "2300e1ca-ea17-4144-8a9d-8aabb9392319", "translation" => "The architecture of this museum is distinctive, with an exterior cylindrical shape and an arched structure on the inside. Once used as a gunpowder factory, Dar el-Baroud has been transformed into a museum dedicated to antiquities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8cac0ca1-6077-4439-afe3-6cbebca9e942", "translation" => "L'architecture de ce musée est distinctive, avec une forme cylindrique extérieure et une structure en forme d'arc à l'intérieur. Autrefois utilisé comme une fabrique de poudre, Dar el-Baroud a été transformé en un musée dédié aux antiquités.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "62af3038-3cf9-4f16-99b9-3f30e508dc43", "translation" => "عمارة هذا المتحف مميزة، حيث يتميز بشكله الخارجي الأسطواني وبنية مستدقة في الداخل. كان يُستخدم في السابق كمصنع للبارود، وقد تم تحويله إلى متحف مخصص للآثار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1494
            ["id" => "be2c43ee-cc04-4236-8bda-ab152a28334b", "translation" => "The city of Chlef has invested in the creation of four green spaces, including the Bensouna garden, with a commitment to reforestation to restore its former charm. You will be impressed by the dedication of associations and local communities to preserve the city's green heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f93ccf22-23dc-49a6-be36-84383f3f9ce6", "translation" => "La ville de Chlef a investi dans la création de quatre espaces verts, dont le jardin Bensouna, avec une promesse de reboisement pour restaurer le charme d'antan. Vous serez impressionné par l'engagement des associations et des collectivités locales pour préserver le patrimoine vert de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c4620ee6-e622-499d-8dbe-aeb259b2a317", "translation" => "مدينة الشلف قامت بالاستثمار في إنشاء أربعة مساحات خضراء، بما في ذلك حديقة بن سونة, مع التعهد بإعادة التشجير لاستعادة سحر الماضي. ستكون مندهشًا من التفاني الذي تظهره الجمعيات والجهات المحلية في الحفاظ على التراث الأخضر للمدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1495
            ["id" => "c5acea2c-efea-4d0e-b34e-ecfec10732f9", "translation" => "The Chorfa amusement park is the perfect place to spend dreamy family days, create precious memories, and share moments of happiness together.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f5706f97-5e01-49f6-be67-6bb357a07312", "translation" => "Le parc d'attractions de Chorfa est l'endroit idéal pour passer des journées de rêve en famille, créer des souvenirs précieux et partager des moments de bonheur ensemble.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8a7b6f74-73ec-4276-87dc-622d1db8ba4b", "translation" => "حديقة التسلية الشرفة هي المكان المثالي لقضاء أيام أسرية مذهلة، وخلق ذكريات قيمة، ومشاركة لحظات سعيدة معًا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1496
            ["id" => "9dcfa977-86ee-490d-be24-272c054741a4", "translation" => "A visit to this park promises an unforgettable experience, where serenity and adventure meet in an enchanting setting that will be etched in the memories of every visitor.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cb4d9ee4-4224-46d4-a075-b592fe4331cd", "translation" => "Une visite dans ce parc promet une expérience inoubliable, où la sérénité et l'aventure se rencontrent dans un cadre enchanteur qui restera gravé dans les souvenirs de chaque visiteur.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "02b4f25f-956f-469c-83ab-af5284fc3469", "translation" => "زيارة هذا المنتزه تعد وعدًا بتجربة لا تُنسى، حيث تلتقي السكينة والمغامرة في إطار ساحر سيبقى خالدًا في ذكريات كل زائر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1497
            ["id" => "df5a0117-28e3-42a9-833e-5a3c03efa904", "translation" => "This public garden is a welcoming place that provides a welcome break from urban hustle and bustle, allowing everyone to recharge in the midst of nature and community.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "75cd60d0-35c9-4d2c-ac4c-d73d9c1f43ff", "translation" => "Ce jardin public est un endroit accueillant qui offre un répit bienvenu de l'agitation urbaine, permettant à chacun de se ressourcer au contact de la nature et de la communauté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1591e634-62f9-43d8-b7f1-3053ba294d2a", "translation" => "هذه الحديقة العامة هي مكان مرحب يوفر استراحة مرغوبة من صخب الحياة الحضرية، مما يسمح للجميع بالراحة في عناق الطبيعة والمجتمع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1498
            ["id" => "94185a10-1e8a-471a-ba4e-843d331ed648", "translation" => "Bir el Djanb is a mysterious and fascinating place, steeped in stories related to its historical and geological past. It impresses with its imposing diameter of approximately 30 meters, while its depth remains unknown to this day, adding to its mystique.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a20022a1-6625-48dc-a958-98feaf1b6c5a", "translation" => "Bir el Djanb est un endroit mystérieux et fascinant, chargé d'histoires liées à son passé historique et géologique. Il impressionne par son diamètre imposant d'environ 30 mètres, tandis que sa profondeur reste encore inconnue à ce jour, ajoutant à son aura mystique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "eddd69ab-d4ea-4552-93c7-e95f2cc27187", "translation" => "بئر الجنب هو مكان غامض ومثير، مليء بالقصص المرتبطة بتاريخه وجيولوجيته. إنه يثير الإعجاب بقطره الضخم البالغ حوالي 30 مترًا، بينما تظل عمقه مجهولًا حتى اليوم، مما يزيد من سحره الغامض.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1499
            ["id" => "b488c167-cc12-41ee-896e-4ae6aa3750f0", "translation" => "The blue lake of Zeboudja is not only a leisure destination but also a place filled with tranquility and natural beauty, where visitors can escape the hustle and bustle of daily life and rejuvenate in the heart of pristine nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "72420c41-dbed-4eea-9123-b6b54e54632c", "translation" => "Le lac bleu de Zeboudja est non seulement une destination de loisirs, mais aussi un lieu empreint de tranquillité et de beauté naturelle, où les visiteurs peuvent s'évader de l'agitation de la vie quotidienne et se ressourcer au cœur de la nature préservée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d164b07b-5768-49c1-8a22-2cccf2f53162", "translation" => "القلتة الزرقاء ليست مجرد وجهة ترفيهية، بل هي أيضًا مكان مليء بالسكينة والجمال الطبيعي، حيث يمكن للزوار الهروب من صخب الحياة اليومية والاستجمام في قلب الطبيعة الخالية من التلوث.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1500
            ["id" => "076a8242-4f3a-4f42-a333-a1eb18754664", "translation" => "Whether you're an outdoor enthusiast, a nature lover, or simply seeking a peaceful getaway, the Sidi Yakoub dam is the perfect place for a memorable day.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "89868113-21c6-4627-b0dd-8a56396fe0d0", "translation" => "Que vous soyez un amateur de plein air, un amoureux de la nature ou simplement à la recherche d'une évasion tranquille, le barrage de Sidi Yakoub est l'endroit idéal pour une journée mémorable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "427967bc-1c10-4936-9bf3-6260c5ca03c6", "translation" => "سواء كنت عاشقًا للأنشطة في الهواء الطلق، أو محبًا للطبيعة، أو مجردًا تبحث عن هروب هادئ، فسد سيدي يعقوب هو المكان المثالي لقضاء يوم لا يُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1501
            ["id" => "69397b2e-e708-448b-80f1-2a9885ba97b8", "translation" => "The shores of Kef Eddir dam invite you to escape from the hustle and bustle of everyday life. Take a stroll along the winding trails that will lead you to spectacular panoramic viewpoints.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3c90235b-b8e7-4e57-85d2-081fea84fbde", "translation" => "Les rives du barrage de Kef Eddir vous invitent à vous évader de l'agitation de la vie quotidienne. Promenez-vous le long des sentiers sinueux qui vous mèneront à des points de vue panoramiques spectaculaires.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c561f856-eced-4180-b575-499a74c188c4", "translation" => "شواطئ سد كاف الدير تدعوكم للاستمتاع بالهروب من صخب الحياة اليومية. تجولوا على طول الدروب المتعرجة التي ستقودكم إلى مناظر بانورامية رائعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1502
            ["id" => "7bff5e8f-7a9e-4451-acaa-f7df5c5dede5", "translation" => "Nestled in the heart of a picturesque landscape, this majestic dam offers much more than water captured within its imposing walls. Its tranquil waters reflect the surrounding mountains and the azure blue sky, creating a breathtaking tableau for photography enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f1df0a83-fdf8-4b95-bb20-ae7097883ea8", "translation" => "Niché au cœur d'un paysage pittoresque, ce barrage majestueux offre bien plus que de l'eau capturée entre ses murs imposants. Ses eaux tranquilles reflètent les montagnes environnantes et le ciel bleu azur, créant un tableau à couper le souffle pour les amoureux de la photographie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ed27a31f-0da2-4bc7-afd8-ab126778abb1", "translation" => "موجود في قلب منظر طبيعي خلاب، يقدم هذا السد الرفيع أكثر من مجرد مياه محتجزة بين جدرانه الضخمة. مياهه الهادئة تعكس الجبال المحيطة والسماء الزرقاء الصافية، مما يخلق لوحة خلابة تستحق التصوير لعشاق هذا الفن.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1503
            ["id" => "13aac97b-c0ac-4bfd-9ec1-cce79bb336d7", "translation" => "Come and discover the splendor of the Bahara beach, a true hidden treasure. Far from the urban hustle and bustle, this stretch of golden sand welcomes you to a haven of peace.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "482d5a9d-abe0-444c-bb92-d7bc7f44af65", "translation" => "Venez découvrir la splendeur de la plage Bahara, un véritable trésor caché. Loin de l'agitation urbaine, cette étendue de sable doré vous accueille dans un havre de paix.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0bb44752-b221-4527-bb6f-178306d7003e", "translation" => "تعال واكتشف روعة شاطئ بحارة, كنزًا حقيقيًا مخفيًا. بعيدًا عن صخب المدينة، ترحب بك هذه الشريطة من الرمال الذهبية في ملاذ للسلام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1504
            ["id" => "222ff1c2-25ab-4b6f-b2e2-fe78c7aece37", "translation" => "Come and relax in this idyllic setting, where serenity awaits you at every grain of sand. An unforgettable experience awaits you at the Kharbet beach, where well-being is the priority.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9ebd08d1-bd17-482d-a49c-b48c5e6aa8a1", "translation" => "Venez vous détendre dans ce cadre idyllique, où la sérénité vous attend à chaque coin de sable. Une expérience inoubliable vous attend à la plage de Kharbet, où le bien-être est la priorité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d52f916e-4e51-4363-8c12-e69d2bd04bc0", "translation" => "تعال واسترخِ في هذا الإطار الجميل، حيث تنتظرك السكينة في كل رملة. تجربة لا تُنسى تنتظرك في شاطئ خاربات, حيث الرفاهية هي الأولوية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1505
            ["id" => "03b2206f-cb3f-4501-8f64-e6dc09bb10e0", "translation" => "Welcome to the Marsa Sheikh beach, a haven of friendliness and family relaxation. Its shores offer an exceptional beach experience, inviting visitors to immerse themselves in its crystal-clear waters, lounge on its soft sandy stretches, and even enjoy memorable camping sessions.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ca3909ab-92bc-44e5-83e8-7506cb658161", "translation" => "Bienvenue à la plage Marsa Cheikh, un havre de convivialité et de détente en famille. Ses rivages h offrent une expérience balnéaire exceptionnelle, invitant les visiteurs à se plonger dans ses eaux cristallines, à se prélasser sur ses douces étendues de sable et même à profiter de séances de camping mémorables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8a5019be-c83b-44f5-971d-fb5092e21778", "translation" => "مرحبًا في شاطئ مرسى الشيخ، ملاذ للألفة والاسترخاء مع العائلة. يقدم شواطئه تجربة شاطئية استثنائية، حيث يدعو الزوار إلى الانغماس في مياهه الصافية الكريستالية، والاسترخاء على مدى رماله الناعمة، وحتى الاستمتاع بجلسات تخييم لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1506
            ["id" => "120c0536-6b29-4b6e-a2dd-3095cf7f1f2a", "translation" => "Let yourself be enchanted by the unique blend of sand and pebbles, and enjoy precious moments with your family while admiring the picturesque beauty that surrounds you. Come and discover the Sidi Abdelkader beach, where tranquility and nature come together to create unforgettable memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c7b7d3f9-17db-46f4-9f82-865daa118e12", "translation" => "Laissez-vous envoûter par le mélange unique de sable et de galets, et profitez de moments précieux en famille tout en admirant la beauté pittoresque qui vous entoure. Venez découvrir la plage Sidi Abdelkader, où la tranquillité et la nature se rejoignent pour créer des souvenirs inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "70192779-9ba7-4fab-8d9c-59a9ddf33cf0", "translation" => "دعوا أنفسكم تتسحرن بالمزيج الفريد من الرمل والحصى، واستمتعوا بلحظات ثمينة مع عائلتكم مشاهدين في الجمال الخلاب الذي يحيط بكم. تعالوا واكتشفوا شاطئ سيدي عبد القادر، حيث تلتقي السكينة والطبيعة لخلق ذكريات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1507
            ["id" => "2a9339e9-bcb7-41c1-9a60-f782a46f329d", "translation" => "Stretching majestically along the coastline, the Lalla Ada beach offers a harmonious blend of sand and smooth pebbles, creating a visually captivating landscape. Although unguarded, this beach retains its natural charm and invites visitors to relax in a peaceful setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "32b5be55-9543-4486-88dc-2ec788a219cd", "translation" => "S'étendant majestueusement le long du littoral, la plage de Lalla Ada offre un mélange harmonieux de sable et de galets lisses, créant un paysage visuellement captivant. Bien que non surveillée, cette plage conserve son charme naturel et invite les visiteurs à se détendre dans un cadre paisible.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "95f93bc1-ae26-441d-a67e-6a32609932c0", "translation" => "يمتد شاطئ لالة عدة على طول الساحل بأمجاده، ويقدم مزيجاً متناغماً من الرمل والحصى الناعمة، مما يخلق مناظر بصرية جذابة. على الرغم من عدم وجود مراقبة، إلا أن هذا الشاطئ يحتفظ بجاذبيته الطبيعية ويدعو الزوار إلى الاسترخاء في بيئة هادئة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1508
            ["id" => "b6143086-3477-4928-8421-dc7f2f8545cc", "translation" => "Venturing off the beaten path, the Tansyouf beach offers a rare sense of privacy seldom found elsewhere. Its charm lies in its challenging access, creating a feeling of exclusivity for those who choose to venture there.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "562ddec9-1b0f-465f-ad77-88f2567ba67f", "translation" => "S'éloignant des sentiers battus, la plage Tansyouf offre une intimité rarement trouvée ailleurs. Son charme réside dans sa difficulté d'accès, créant un sentiment d'exclusivité pour ceux qui choisissent de s'y aventurer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7e5dfd6e-9e0f-4583-959e-7d78afbb7b89", "translation" => "يبتعد شاطئ تنسيوف عن المسارات المعهودة ويوفر خصوصية نادرة تجد نادرًا في أماكن أخرى. سحره يكمن في صعوبة الوصول إليه، مما يخلق إحساسًا بالاستثناء لأولئك الذين يختارون الاستكشاف فيه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1509
            ["id" => "f96252c8-483f-4ee3-be6e-cfacee6e8d15", "translation" => "The Kramis dam invites you to immerse yourself in a world of tranquility and serenity. Enjoy a panoramic view of the sparkling waters of the reservoir and let yourself be embraced by the peacefulness of this unique place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1d06eec3-b851-4485-b92d-78d49b2e4ad8", "translation" => "Le barrage Kramis vous invite à plonger dans un monde de tranquillité et de sérénité. Profitez d'une vue panoramique sur les eaux scintillantes du réservoir et laissez-vous envelopper par la quiétude de cet endroit unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "42f22ece-f908-4823-90fb-4bebf07e0b40", "translation" => "سد كراميس يدعوكم للانغماس في عالم من السكينة والهدوء. استمتعوا بإطلالة بانورامية على المياه المتلألئة للخزان واتركوا أنفسكم تلتفّ حول هدوء هذا المكان الفريد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1510
            ["id" => "7754350e-e69c-4f67-9a53-27ce5b6ecd90", "translation" => "This garden invites you to escape from the urban hustle and immerse yourself in an oasis of calm and tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "580eb0ab-64dd-47d4-8f11-59e73d9e77fb", "translation" => "Ce jardin vous invite à vous échapper de l'agitation urbaine et à vous plonger dans une oasis de calme et de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b109cf7e-74c5-439e-af2f-86e51f09c55a", "translation" => "هذه الحديقة تدعوكم للابتعاد عن صخب الحياة الحضرية والانغماس في واحة من الهدوء والسكينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1511
            ["id" => "a733d334-1269-4d3a-bd27-b93057b33753", "translation" => "Whether you simply want to sunbathe, swim, or explore the surroundings, the Kef Kadous beach awaits you for an unforgettable beach experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f1ab6be8-6785-4b1d-b6e3-f206de1627e8", "translation" => "Que vous souhaitiez simplement vous prélasser au soleil, vous baigner ou explorer les environs, la plage de Kef Kadous vous attend pour une expérience balnéaire inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "694cd385-0eb6-48f7-a58f-0b0d51d73348", "translation" => "سواء كنت ترغب ببساطة في التشمس، السباحة، أو استكشاف المحيط، شاطئ كاف قادوس ينتظرك لتجربة شاطئ لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1512
            ["id" => "4bbb1f27-4d5d-4a9b-8bf5-dc05ed9bd558", "translation" => "In addition to its coastal beauty, the Sidi Laadjal beach is a place teeming with marine life. The fish-rich waters provide an opportunity for fishing, and the rare birds that frequent this place add a touch of mystery to your experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7b5c76d7-e204-4d00-85f3-7ef1f49c7a80", "translation" => "En plus de la beauté côtière, la plage Sidi Laadjal est un endroit où la vie marine abonde. Les eaux riches en poissons vous offrent une opportunité de profiter de la pêche, et les oiseaux rares qui fréquentent cet endroit ajoutent une touche de mystère à votre expérience.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "65ec9ea9-21dd-4e13-9b2e-cbc5e68fd495", "translation" => "بالإضافة إلى جمالها الساحلي، شاطئ سيدي لعجال هو مكان حيث تزخر الحياة البحرية. المياه الغنية بالأسماك تقدم لك فرصة لممارسة الصيد، والطيور النادرة التي تزور هذا المكان تضيف لمسة من الغموض إلى تجربتك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1513
            ["id" => "56164727-77fe-417c-8599-71ba60004272", "translation" => "Whether you're seeking tranquility or looking for a peaceful getaway for your vacation, the Oued Romane beach warmly welcomes you. Enjoy an exceptional beach experience, filled with natural beauty and cleanliness, while relaxing in this corner of paradise.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ca255d8e-79dd-4828-a207-3dfc8ca44335", "translation" => "Que vous soyez en quête de tranquillité ou que vous aspiriez à un coin tranquille pour vos vacances, la plage d’Oued Romane vous accueille chaleureusement. Profitez d'une expérience balnéaire exceptionnelle, empreinte de beauté naturelle et de respect pour la propreté, tout en vous relaxant dans ce coin de paradis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bfb5b627-6b8c-4f16-bcf9-463e47dd4015", "translation" => "سواء كنت تبحث عن الهدوء أو كنت تتوق إلى مكان هادئ لعطلتك، شاطئ واد الرمان يرحب بك. استمتع بتجربة شاطئ استثنائية، مليئة بالجمال الطبيعي والنظافة، بينما تسترخي في هذه الزاوية الجميلة من الجنة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1514
            ["id" => "03b504d2-4089-46e3-81fe-c475a82b8e0e", "translation" => "This coastal haven is renowned for its unparalleled natural beauty, in harmony with the lush woods that surround it and its refreshing spring that gushes even at the heart of the beach, adding a special touch to this place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4f0a5833-c311-4379-9c4c-948c937ecde7", "translation" => "Ce havre côtier est renommé pour sa beauté naturelle inégalée, en harmonie avec les bois verdoyants qui l'entourent et sa source rafraîchissante qui jaillit même au cœur de la plage, ajoutant une touche spéciale à ce lieu.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "76fe8582-cd8d-4f51-8f43-e0b46e0b7e26", "translation" => "هذا الملاذ الساحلي مشهور بجماله الطبيعي الفريد، والذي يتناغم مع الغابات الخضراء المحيطة به وينبعه المنعش الذي ينبع حتى في قلب الشاطئ، مما يضيف لمسة خاصة إلى هذا المكان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1515
            ["id" => "e4252260-1d23-4e2e-a7b4-cbdf37d2083a", "translation" => "The Sedawa beach is much more than just a shoreline. It's a sensory experience where the sights and sounds of the sea blend to create a haven of relaxation. Come explore this coastal paradise, where soothing blue waters and golden sands invite you to escape and reconnect with the pure beauty of nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3b7b65fb-c0a9-430a-a4fe-5133100a236d", "translation" => "La plage de Sedawa est bien plus qu'un simple rivage. C'est une expérience sensorielle où la vue et les sons de la mer se mélangent pour créer un havre de détente. Venez explorer ce coin de paradis côtier, où les eaux bleues apaisantes et le sable doré vous invitent à vous évader et à vous reconnecter avec la beauté pure de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c6d2f6f1-ea32-4fba-a32f-489b8e4b1b93", "translation" => "شاطئ سداوة هو أكثر من مجرد ساحل. إنها تجربة حسية حيث تمتزج مناظر البحر وأصواته لتخلق ملاذًا للراحة. تعالوا اكتشفوا هذه الجنة الساحلية، حيث تدعوكم المياه الزرقاء المهدئة والرمال الذهبية للهروب وإعادة الاتصال مع جمال الطبيعة النقية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1516
            ["id" => "3ea04d28-29ca-4f58-b813-bb4b68c4ccd8", "translation" => "The Sidi Lakhdar fishing port is much more than just a workplace. It is a living witness to coastal life, where age-old traditions and maritime professions harmoniously blend with the beauty of the Mediterranean Sea. Come immerse yourself in this authentic atmosphere and observe the ballet of fishing boats, an experience that will immerse you in the heart of the maritime life of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "264f5994-3b1d-4bf5-91a2-036cfc0917bf", "translation" => "Le port de pêche de Sidi Lakhdar est bien plus qu'un simple lieu de travail. C'est un témoin vivant de la vie côtière, où les traditions séculaires et les métiers maritimes se mêlent harmonieusement à la beauté de la mer Méditerranée. Venez vous immerger dans cette atmosphère authentique et observez le ballet des bateaux de pêcheurs, une expérience qui vous plongera au cœur de la vie maritime de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0a436061-0f1d-4908-9b24-1d398bf15157", "translation" => "ميناء الصيد سيدي لخضر هو أكثر من مجرد مكان عمل. إنه شاهد حي للحياة الساحلية، حيث تمتزج التقاليد القديمة ومهن البحر بانسجام مع جمال البحر الأبيض المتوسط. تعال وانغمس في هذا الجو الأصيل وشاهد رقصة قوارب الصيادين، تجربة ستغمرك في قلب حياة البحر في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1517
            ["id" => "a0f561b9-5b32-4adc-90bd-59a3d13e2e4c", "translation" => "Whether you simply want to bask in the sun, swim in clear waters, or explore the surroundings, the East small port beach promises you unforgettable moments by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "637cad38-6631-430d-be29-b735372dc899", "translation" => "Que vous souhaitiez simplement vous prélasser au soleil, nager dans des eaux claires ou explorer les environs, la plage du petit port Est vous promet des moments inoubliables au bord de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9f43de8d-f59b-481f-b81b-ba335ffda350", "translation" => "سواء كنت ترغب ببساطة في الاسترخاء تحت أشعة الشمس، السباحة في مياه نقية، أو استكشاف المناطق المحيطة، شاطئ الميناء الصغير الشرقي يعدك بأوقات لا تُنسى على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1518
            ["id" => "d4bd18f0-bacb-43a1-9de8-d528c60c9a1b", "translation" => "If you're in search of a slice of paradise, it is recommended to visit the West small port beach. This place ranks among the most beautiful treasures, offering you comfort, serenity, and tranquility, creating an environment conducive to relaxation and introspection.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "46d1ca18-a34b-4513-9504-1ad3730717da", "translation" => "Si vous recherchez un coin de paradis, il est recommandé de visiter la plage du petit port ouest. Cet endroit compte parmi les plus beaux trésors qui vous offrent confort, sérénité et calme, créant un environnement propice à la détente et à l'introspection.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cc6df60d-488a-4363-bdb0-3b21c5db644e", "translation" => "إذا كنت تبحث عن قطعة من الجنة، يُوصى بزيارة شاطئ الميناء الصغير الغربي. يعتبر هذا المكان من بين أجمل الكنوز التي تقدم لك الراحة والسكينة والهدوء، مما يخلق بيئة تُشجع على الاسترخاء والتأمل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1519
            ["id" => "11a077b6-57a2-4dab-8c8a-519c2623b5c5", "translation" => "The irresistible charm of the Kef Lasfar beach lies in its landscape, where sand harmoniously blends with rocks. A majestic cliff overlooks the sea, sometimes reaching over 30 meters in height, creating a breathtaking backdrop.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f774648c-fba2-44b8-9837-698fe4933864", "translation" => "Le charme irrésistible de la plage de Kef Lasfar réside dans son paysage, où le sable se mêle harmonieusement aux rochers. Une falaise majestueuse surplombe la mer, atteignant parfois plus de 30 mètres de hauteur, créant ainsi un décor à couper le souffle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e5a236eb-aef9-4209-8921-b1858a2d957e", "translation" => "سحر شاطئ الكاف الأصفر يكمن في مناظره، حيث يمتزج الرمل بانسجام مع الصخور. يطل صخرة مهيبة على البحر، وتصل في بعض الأحيان إلى أكثر من 30 مترًا في الارتفاع، مما يخلق خلفية رائعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1520
            ["id" => "f6a28f64-ae94-4320-8579-e187283ef3a2", "translation" => "Sidi Lakhdar Ben Khlouf was a passionate praiser of the Prophet and an exceptional Sufi poet of his time. He belonged to the Mazila tribe, a descendant of the Ouled Khalouf, within the emirate of Mughrawa, the first Islamic emirate formed in Algeria after the conquest. His poetic and spiritual legacy has left a lasting imprint in the field of Sufi poetry.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6365b25a-4c9f-40bf-891f-ae3f4d95822a", "translation" => "Sidi Lakhdar Ben Khlouf était un laudateur passionné du Prophète et un poète soufi exceptionnel de son temps. Il appartenait à la tribu Mazila, descendant des Ouled Khalouf, au sein de l'émirat de Mughrawa, le premier émirat islamique formé en Algérie après la conquête. Son héritage poétique et spirituel a laissé une empreinte durable dans le domaine de la poésie soufie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5f5f1ab2-f518-44ce-bb86-8ad6f9cfb343", "translation" => "سيدي لخضر بن خلوف كان ممجّدًا متحمسًا للنبي وشاعرًا صوفيًا استثنائيًا في عصره. كان ينتمي إلى قبيلة المزيلة وكان نسبًا من ذرية أولاد خلوف، ضمن إمارة مغراوة، وهي أول إمارة إسلامية تشكلت في الجزائر بعد الفتح. ترك إرثه الشعري والروحي بصمة دائمة في ميدان الشعر الصوفي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1521
            ["id" => "d77f2155-61f1-4b1e-80e1-3ed72e2fde2d", "translation" => "This garden invites you to escape from urban hustle and immerse yourself in an oasis of calm and tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "890cb0f8-e2a0-433e-ae29-5c6d324bed9b", "translation" => "Ce jardin vous invite à vous échapper de l'agitation urbaine et à vous plonger dans un oasis de calme et de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "10d7346f-7e49-473f-8a05-0aea874ba45d", "translation" => "هذه الحديقة تدعوكم للابتعاد عن صخب الحياة الحضرية والانغماس في واحة من الهدوء والسكينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1522
            ["id" => "80be3537-bdd7-4fb6-bd65-fdf150f69997", "translation" => "The East Hadjadj beach is a true haven of relaxation that meets the expectations of even the most demanding vacationers. This spacious beach stretches over 7000 meters of golden sand, providing generous space to accommodate up to 30,000 bathers seeking joy and refreshment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d2f6ff68-c3c2-4d7d-894f-8bdef8163542", "translation" => "La plage de Hadjadj Est est un véritable havre de détente qui comble les attentes des estivants les plus exigeants. Cette plage spacieuse s'étire sur 7000 mètres de sable doré, offrant un espace généreux pour accueillir jusqu'à 30 000 baigneurs en quête de joie et de rafraîchissement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "48aa81c5-8b57-42dd-bcd4-aae8bb7b988d", "translation" => "شاطئ حجاج الشرقي هو ملاذ حقيقي للاسترخاء يلبي توقعات العديد من العطلاء الأكثر تطلبًا. يمتد هذا الشاطئ الواسع على مدى 7000 متر من الرمال الذهبية، مما يوفر مساحة سخية لاستيعاب ما يصل إلى 30,000 سائح يبحثون عن الفرح والانتعاش.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1523
            ["id" => "21c88d9f-14a7-4600-8c23-07686f24b469", "translation" => "Whether you want to lounge on the fine sand, swim in the refreshing waters, or take a stroll in the nearby forest, the West Hadjadj beach has everything to offer for a memorable beach experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "462a2f1d-c49f-4cc1-a1fd-286fe41a63dc", "translation" => "Que vous souhaitiez vous prélasser sur le sable fin, vous baigner dans les eaux rafraîchissantes ou vous promener dans la forêt voisine, la plage de Hadjadj Ouest a tout pour vous offrir une expérience balnéaire mémorable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "88cda19b-37ca-414a-9fa3-32bacb7a8215", "translation" => "سواء كنتم ترغبون في الاسترخاء على الرمال الناعمة، أو السباحة في مياه منعشة، أو التجول في الغابة القريبة، فإن شاطئ حجاج الغربي يقدم كل ما تحتاجونه لتجربة شاطئ لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1524
            ["id" => "af471c25-c194-4def-85e6-faf73822ef2c", "translation" => "The coastal landscape of the Kef Ouair beach is an enchanting combination of dunes, forests, and rock formations, providing a unique natural experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "11cbb49c-3afc-4949-b83a-d699afd2ec6d", "translation" => "Le paysage côtier de la plage de Kef Ouair est une combinaison enchanteresse de dunes, de forêts et de formations rocheuses, offrant une expérience naturelle unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b769354e-c422-466b-aa44-1e30b5185e2e", "translation" => "المناظر الساحلية لشاطئ كاف أوعير هي مزيج ساحر من الكثبان والغابات وتشكيلات الصخور، مما يقدم تجربة طبيعية فريدة من نوعها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1525
            ["id" => "947d67e0-2328-406a-a6fa-7077f67bac24", "translation" => "The Clovis beach has earned a well-deserved reputation for cleanliness and hospitality. Its white sand extends generously, creating ample space for thousands of swimmers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "217dbe6f-4ff9-4f2e-94dc-359076411c1a", "translation" => "La plage Clovis s'est forgée une réputation méritée de propreté et d'hospitalité. Son sable blanc s'étend généreusement, créant un espace spacieux pour des milliers de baigneurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a7465962-67ad-4ab7-a79c-6f9edd233586", "translation" => "شاطئ كلوفيس قد حصل على سمعة مستحقة من النظافة والضيافة. الرمال البيضاء تمتد بشكل وفير، مما يخلق مساحة واسعة لآلاف السباحين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1526
            ["id" => "de5dfffc-2baa-4c0d-ab54-6ca36a6f703e", "translation" => "The El Marsa beach offers an exceptional beach experience where natural beauty meets tranquility and friendliness. It's the perfect place for relaxing family moments and letting the gentle waves of the sea lull you.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "62e54b1f-90bf-4f2f-915d-718a3fe82ab1", "translation" => "La plage d'el Marsa offre une expérience balnéaire exceptionnelle, où la beauté naturelle rencontre la tranquillité et la convivialité. C'est l'endroit parfait pour des moments de détente en famille et pour se laisser bercer par les vagues douces de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8a2f3581-df12-49a9-8faa-448dbfecdc75", "translation" => "شاطئ المرسى يقدم تجربة شاطئية استثنائية حيث تلتقي الجمال الطبيعي بالهدوء والألفة. إنه المكان المثالي لقضاء أوقات استرخاء مع العائلة والسماح لأمواج البحر اللطيفة بتهدئتك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1527
            ["id" => "ea4b72bb-6570-4975-bb9b-a4237a4a4cde", "translation" => "This beach offers breathtaking natural beauty, with its soothing calm, a stretch of sand providing ample space for sunbathing, and a refreshing touch from a nearby freshwater spring.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f4ab1e5d-3eb6-4f90-af0a-21e651ae43ed", "translation" => "Cette plage offre une beauté naturelle à couper le souffle, avec son calme apaisant, son étendue de sable offrant amplement d’espace pour se prélasser au soleil et une touche rafraîchissante grâce à une source d'eau douce toute proche.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6218d3e3-fe91-4db3-9f10-3c58debab5c2", "translation" => "هذا الشاطئ يقدم جمالًا طبيعيًا خلابًا، مع هدوء مهدئ، ومساحة من الرمال توفر مساحة وافرة للتمتع بأشعة الشمس ولمسة منعشة من ينبوع مياه عذبة قريب.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1528
            ["id" => "f162f619-f470-483e-889e-83b4e7d861eb", "translation" => "Cap Ivi is a beach that stands out for its unique charm. It has managed to capture the essence of natural beauty while preserving its authentic character. Access can sometimes be a bit challenging, but it's an adventure worth undertaking. Once there, you will be rewarded with an unforgettable swimming experience and a panoramic view that will leave you in awe.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "826dac1a-6464-4e8c-9010-a569cdd6980d", "translation" => "Cap Ivi est une plage qui se distingue par son charme unique. Elle a su capturer l'essence de la beauté naturelle tout en préservant son caractère authentique. L'accès peut parfois être un peu difficile, mais c'est une aventure qui en vaut la peine. Une fois sur place, vous serez récompensés par une expérience de baignade inoubliable et une vue panoramique qui vous laissera émerveillés.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a1a5de01-f6f9-4cd0-8566-6ab3725a6cbb", "translation" => "كاب إيفي هو شاطئ يتميز بسحره الفريد. تمكن من التقاط جوهر الجمال الطبيعي مع الحفاظ على طابعه الأصيل. قد يكون الوصول إليه أحيانًا قليلاً صعبًا، ولكنها مغامرة تستحق العناء. مرة واحدة هناك، ستجدون أنفسكم مكافأة بتجربة سباحة لا تُنسى وإطلالة بانورامية ستدهشكم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1529
            ["id" => "8e51085a-faff-487a-bf63-d39d3fb19042", "translation" => "The Chaïbia beach welcomes you in a clean and well-maintained environment, providing a warm and family-friendly atmosphere that will make you feel at home.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "94ce44e8-ac96-4ad8-bc4f-094213db9aba", "translation" => "La plage de Chaïbia vous accueille dans un environnement propre et soigné, offrant une ambiance chaleureuse et familiale qui vous fera vous sentir comme chez vous.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f9b9964c-4fd5-4d85-aef0-65efb3bfba65", "translation" => "شاطئ الشعايبية يرحب بكم في بيئة نظيفة ومُحافظة، ويوفر جوًا دافئًا وعائليًا يجعلكم تشعرون وكأنكم في منزلكم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1530
            ["id" => "bafbca37-4fe3-49ff-b188-015a90f7cac7", "translation" => "Come and explore the Sakhra beach for moments of relaxation, swimming, and coastal enjoyment. Enjoy the natural beauty and convenient facilities that make this beach an ideal destination for a getaway with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dd99dc2e-4294-4834-bd42-f0d6dd7208e2", "translation" => "Venez découvrir la plage de Sakhra pour des moments de détente, de baignade et de plaisirs côtiers. Profitez de la beauté naturelle et des installations pratiques qui font de cette plage un lieu idéal pour une escapade en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8913450e-ae51-439f-a2ac-2f773d7980d1", "translation" => "تعالوا واكتشفوا شاطئ الصخرة لقضاء لحظات من الاسترخاء والسباحة والاستمتاع على الساحل. استمتعوا بالجمال الطبيعي والمرافق العملية التي تجعل هذا الشاطئ وجهة مثالية للهروب مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1531
            ["id" => "84bb5c53-430c-48d6-8745-04cd5b393a4b", "translation" => "The location of the West Cheliff beach just 12 kilometers from the bustling center of Mostaganem makes it a perfect beach getaway, where you can sunbathe, enjoy the sparkling waves of the sea, and create memorable moments.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e087ff4e-799f-4d7d-b1de-ef8db91653c5", "translation" => "L’emplacement de la plage du Cheliff Ouest à seulement 12 kilomètres du centre animé de Mostaganem en fait une escapade balnéaire parfaite, où vous pourrez vous prélasser au soleil, profiter des vagues scintillantes de la mer et créer des souvenirs mémorables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5efad02f-19a6-4776-95bc-ce3d4ad895ec", "translation" => "موقع شاطئ الشلف الغربي على بُعد 12 كيلومترًا فقط من وسط مدينة مستغانم الحيوي يجعله مكانًا مثاليًا للهروب إلى الشاطئ، حيث يمكنكم التمتع بأشعة الشمس والاستمتاع بأمواج البحر المتلألئة وخلق لحظات تُذكر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1532
            ["id" => "3b55dab9-61d7-4648-9215-31fea44b79e0", "translation" => "The Sonacter beach is a true coastal gem, offering a stretch of fine sand of great beauty. This spacious beach invites families to enjoy a peaceful and family-friendly environment. The sea, though occasionally rough, adds a touch of adventure to this beach getaway.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "64dd1409-e9a2-4fe7-afe3-84e6e19fb794", "translation" => "La plage Sonacter est une véritable pépite côtière, offrant une étendue de sable fin d'une grande beauté. Cette plage spacieuse invite les familles à profiter d'un cadre paisible et familial. La mer, bien que parfois agitée, ajoute une touche d'aventure à cette escapade balnéaire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3a5be6e2-064e-4ad8-a1ab-7d09c64b10e3", "translation" => "شاطئ سونكتار هو جوهرة ساحلية حقيقية، حيث يوفر مساحة من الرمال الناعمة الجميلة. هذا الشاطئ الواسع يدعو العائلات للاستمتاع ببيئة هادئة وصديقة للعائلة. البحر، على الرغم من أنه في بعض الأحيان قد يكون عاصفًا، يضيف لمسة من المغامرة إلى هذا الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1533
            ["id" => "a8e248f8-cc32-4403-a869-17236111ac12", "translation" => "For curious explorers, this beach unveils its own network of discoveries, whether it's its intriguing rock formations or the refreshing, crystal-clear waters. the Caves beach awaits you for an unforgettable beach adventure, an escape into the pristine nature of Mostaganem.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6d624523-124e-459e-9cbd-a2307f27eb82", "translation" => "Pour les explorateurs curieux, cette plage dévoile son propre réseau de découvertes, qu'il s'agisse de ses formations rocheuses intrigantes ou des eaux rafraîchissantes et cristallines. La plage des Grottes vous attend pour une aventure balnéaire inoubliable, une échappée au cœur de la nature préservée de Mostaganem.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0d2b0bd0-7aa5-4578-8443-6bc9bb46ae69", "translation" => "بالنسبة للمستكشفين الفضوليين، يكشف هذا الشاطئ عن شبكة اكتشافاتها الخاصة، سواء كان ذلك بفضل تشكيلات الصخور الساحرة أو المياه العذبة والصافية. شاطئ الغيران ينتظرك لمغامرة على الشاطئ لا تُنسى، هروبًا إلى طبيعة مستغانم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1534
            ["id" => "d8bb752a-812c-4dd3-acc1-dbc8753e465a", "translation" => "Away from the crowds, the three brothers cove is perfect for those seeking a secluded refuge, ideal for moments in the great outdoors. Sea lovers and those seeking tranquility will find here a preserved coastal spot, conducive to relaxation and contemplation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7018e6f2-b53e-474b-b641-f9fc8a41076f", "translation" => "Loin de la foule, la crique des trois frères est parfaite pour ceux qui recherchent un refuge isolé, idéal pour des moments en pleine nature. Les amoureux de la mer et de la tranquillité trouveront ici un coin de littoral préservé, propice à la relaxation et à la contemplation.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b46afcc6-4f2f-47ce-84d0-a4ff9fba019a", "translation" => "بعيدًا عن الزحام، خليج الإخوة الثلاثة مثالي لأولئك الذين يبحثون عن ملاذ معزول، مثالي لقضاء أوقات في الطبيعة الخلابة. سيجد عشاق البحر والهدوء هنا مكانًا ساحرًا على الساحل يُشجع على الاسترخاء والتأمل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1535
            ["id" => "55ee0d97-7ca9-44f5-a89c-c398542bf6df", "translation" => "The beach is not only a haven of beauty but also stands out for its cleanliness and soothing tranquility. Essential services are within reach, allowing visitors to fully enjoy their stay.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "481b8edc-4aa2-4854-a6ee-3e260ec43cd0", "translation" => "La plage est non seulement un havre de beauté, mais elle se distingue également par sa propreté et sa tranquillité apaisante. Les services essentiels sont à portée de main, permettant aux visiteurs de profiter pleinement de leur séjour.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "08d4a0e1-5a82-4b7e-96ab-810a3ffb23b9", "translation" => "الشاطئ ليس فقط ملاذاً للجمال، بل يتميز أيضًا بنظافته وهدوئه المُريح. الخدمات الأساسية على مسافة يد، مما يسمح للزوار بالاستمتاع بإقامتهم بشكل كامل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1536
            ["id" => "364d946a-0dfc-463b-afef-75d94dac9312", "translation" => "Its charm lies in its proximity to shops and ease of access through various available modes of transportation. It's a pocket of serenity within reach, where you can immerse yourself in soothing waters and relax on the soft sand after a refreshing swim.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5cdb419e-ff53-4df6-8125-a9c55884832c", "translation" => "Son charme réside dans sa proximité avec les commerces et sa facilité d'accès grâce aux divers modes de transport disponibles. C'est une oasis de sérénité à portée de main, où vous pouvez vous immerger dans les eaux apaisantes et vous ressourcer sur le doux sable après une baignade rafraîchissante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fea907f6-f2f2-468c-a55a-b9e35de5a5fd", "translation" => "سحره يكمن في قربه من المحلات التجارية وسهولة الوصول إليه من خلال وسائل النقل المتاحة المتنوعة. إنه محطة للسكينة على مسافة يد، حيث يمكنك أن تغمر نفسك في مياه مهدئة وتستريح على الرمال الناعمة بعد سباحة منعشة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1537
            ["id" => "ad60a83d-63e3-4267-8751-0c3058a82c0a", "translation" => "For the curious and sea lovers, this coastal enclave provides a unique glimpse into the daily lives of fishermen and their unbreakable connection with the sea. A visit to the fishing port is an authentic and immersive experience that allows you to grasp the maritime soul of this dynamic region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ef0e154d-c28c-4849-bb90-95cccabe90d0", "translation" => "Pour les curieux et les amoureux de la mer, cette enclave côtière offre un aperçu unique du quotidien des pêcheurs et de leur lien indéfectible avec la mer. Une visite au port de pêche est une expérience authentique et immersive qui permet de saisir l'âme maritime de cette région dynamique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dd3d2ecb-794a-456c-8f22-78f7b7ee98b1", "translation" => "بالنسبة للفضوليين وعشاق البحر، تقدم هذه المحمية الساحلية نظرة فريدة إلى حياة الصيادين اليومية وعلاقتهم القوية بالبحر. زيارة ميناء الصيد هي تجربة أصيلة وعميقة تسمح لك بفهم الروح البحرية لهذه المنطقة الديناميكية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1538
            ["id" => "75cf6e32-9f40-459e-93bc-7fb52da906aa", "translation" => "A small picturesque beach that invites you to enjoy family intimacy. The atmosphere is relaxed and peaceful, offering an ideal space to escape from the daily hustle and bustle. The limited presence of visitors, combined with easy parking, will make your getaway even more enjoyable.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cf87987d-8b96-4b3e-8435-78c5c01889fb", "translation" => "Une petite plage pittoresque qui vous invite à profiter d'une intimité familiale. L'atmosphère y est décontractée et paisible, offrant un espace idéal pour échapper à l'agitation quotidienne. La présence limitée de visiteurs, associée à la facilité de stationnement, rendra votre escapade encore plus agréable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2e939691-6651-49ad-8ff8-c2bfd2bb30ca", "translation" => "شاطئ صغير جميل يدعوكم للاستمتاع. الأجواء هنا مريحة وهادئة، مما يوفر مكانًا مثاليًا للهروب من صخب الحياة اليومية. وجود عدد محدود من الزوار، بالإضافة إلى وجود مواقف للسيارات, سيجعلان يومكم أكثر متعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1539
            ["id" => "ca84d135-9d7e-4d89-9211-280d286006c0", "translation" => "This garden is a place where you can get lost in the gentle whispers of nature and the soothing symphony of the sea. It's an enchanting corner where tranquility reigns supreme, inviting visitors to escape the daily hustle and bustle and connect with the natural beauty of Mostaganem.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "660e33c9-4a4b-4436-b87d-596fb845eebb", "translation" => "Ce jardin est un endroit où l'on peut se perdre dans les doux murmures de la nature et la symphonie apaisante de la mer. C'est un coin enchanteur où la tranquillité règne en maître, invitant les visiteurs à s'évader de l'agitation quotidienne et à se connecter avec la beauté naturelle de Mostaganem.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "595ea573-1ec0-4729-80ac-7260e6f883c4", "translation" => "هذه الحديقة هي مكان يمكنك فيه أن تضيع في همسات الطبيعة اللطيفة وسيمفونية البحر المهدئة. إنها زاوية ساحرة حيث الهدوء يسود بشكل أساسي، مما يدعو الزوار إلى الهروب من صخب الحياة اليومية والاتصال بالجمال الطبيعي لمستغانم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1540
            ["id" => "5b5b6955-4a3c-4a74-a3b0-90c1e990e21f", "translation" => "The Ghaliland Park stands out with its well-designed facilities for families and children. It's a place where visitors can enjoy entertaining attractions while creating unforgettable memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fdb14cfd-e800-4762-9147-0ae3ebd22b27", "translation" => "Ghaliland Parc se distingue par ses aménagements bien pensés pour les familles et les enfants. C'est un endroit où les visiteurs peuvent profiter d'attractions divertissantes tout en créant des souvenirs inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "101a1fc9-fca0-42a1-b197-80799a9b6479", "translation" => "منتزه غاليلاند يتميز بتسهيلاته المصممة بعناية للعائلات والأطفال. إنه مكان حيث يمكن للزوار الاستمتاع بألعاب مسلية مع إمكانية خلق ذكريات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1541
            ["id" => "dc7f4698-622d-4db4-9548-7103855c3117", "translation" => "Discover a modern facility offering a variety of pools, slides, and water features for all ages. The more adventurous can zoom down thrilling slides, while the younger ones can have fun in water areas tailored to their size.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a4cfe084-bf43-43c6-98bc-e8e789877b21", "translation" => "Découvrez une structure moderne offrant une variété de bassins, toboggans, et jeux d'eau pour tous les âges. Les plus audacieux pourront dévaler des toboggans palpitants, tandis que les plus jeunes s'amuseront dans des espaces aquatiques adaptés à leur taille.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "25da91f4-12b7-486a-93c7-509114aecdb7", "translation" => "اكتشف هيكلًا حديثًا يقدم مجموعة متنوعة من المسابح والزلاجات والألعاب المائية لجميع الأعمار. يمكن للجريئين أن ينزلقوا على الزلاجات المثيرة، في حين يمكن للأصغر سنًا أن يستمتعوا في مناطق مائية مصممة خصيصًا لحجمهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1542
            ["id" => "a2cb0e93-1cc0-4746-8883-2f7ff0676369", "translation" => "The Golden forest is an enchanting relaxation space nestled in a serene and family-friendly setting. This place strikes the perfect balance between tranquility and cleanliness, offering you a breath of fresh air away from noise and hustle.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d6961eee-3820-4e84-b79f-63e2e7298fb4", "translation" => "La forêt d'or est un espace de repos enchanteur niché dans un cadre reposant et familial. Ce lieu est le parfait équilibre entre tranquillité et propreté, vous offrant une véritable bouffée d'oxygène loin du bruit et de l'agitation.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c91c9d1d-6de8-4183-bf81-4f22f51ab686", "translation" => "حديقة الحرية هي مكان للاسترخاء الساحر مدفون في إعداد هادئ وصديق للعائلة. هذا المكان يجمع بين الهدوء والنظافة بشكل مثالي، مما يقدم لك نفس منعشة بعيدًا عن الضوضاء والاضطرابات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1543
            ["id" => "0e655ae6-c306-4c08-b0c3-d8a3f2251285", "translation" => "From this historic site, you'll enjoy a breathtaking view of the ancient city of Mostaganem, where Arab, Berber, Muslim, Turkish, and French cultures from the colonial era blend harmoniously. It's a true immersion into the rich and diverse history of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fcbe3163-99ef-4a3b-a912-3449503b6f11", "translation" => "Depuis ce site historique, vous bénéficierez d'une vue époustouflante sur la ville ancienne de Mostaganem, où les cultures arabes, berbères, musulmanes, turques et françaises de l'époque coloniale se mêlent harmonieusement. Une véritable immersion dans l'histoire riche et diverse de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cded9ad4-965f-4758-8575-b696fcac931f", "translation" => "من هذا الموقع التاريخي، ستتمتع بإطلالة رائعة على المدينة القديمة لمستغانم، حيث تمتزج بانسجام ثقافات عربية وبربرية وإسلامية وتركية وفرنسية من عهد الاستعمار. إنها تجربة غامرة حقًا في تاريخ المنطقة الغني والمتنوع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1544
            ["id" => "cadf24fa-a1bc-40d9-8713-3a5798f50dbe", "translation" => "Dar el Kaid, an architectural gem with an Ottoman aura, evokes the elegance of a bygone era. Once the residence of the influential Mustafa Kaïd Al-Masrati, this Arab house saw its destiny transformed through the intervention of the state, it was converted into a folklore museum after meticulous restoration in 1998.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2fb60fcf-b01d-4421-9704-55c90373adfe", "translation" => "Dar el Kaid, joyau architectural à l'aura ottomane, évoque l'élégance d'une époque révolue. Jadis demeure de l'influent Mustafa Kaïd Al-Masrati, cette maison arabe a vu sa destinée se transformer grâce à l'intervention de l'État, elle s'est muée en un musée du folklore après une restauration méticuleuse en 1998.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8fbcf2f9-7dbe-4f8f-bd89-de9956c55e8e", "translation" => "دار القايد, جوهرة معمارية بأسلوب الدولة العثمانية، تستحضر أناقة عصر مضى. كانت في السابق منزل المؤثر مصطفى القائد المصراتي، وقد شهد هذا البيت العربي تحول مصيره بفضل تدخل الدولة, تحول إلى متحف للفولكلور بعد عملية استعادة دقيقة في عام 1998.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1545
            ["id" => "3bfa6292-4ea2-44f6-ba26-bbae47ee99a1", "translation" => "The shaded pathways of the Ben Yahia Belkacem garden invite you to a pleasant stroll, while the benches scattered here and there offer you a quiet spot to rest and enjoy the serene atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "72b558da-0cf4-48b6-b1f1-16eee3b70b2d", "translation" => "Les allées ombragées du Jardin Ben Yahia Belkacem vous invitent à une agréable promenade, tandis que les bancs disséminés ici et là vous offrent un coin tranquille pour vous reposer et profiter de l'ambiance sereine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "86f43ba9-dddb-4154-8dce-f2b8664369e0", "translation" => "ممرات حديقة بن يحيى بلقاسم تدعوك إلى نزهة ممتعة، بينما تقدم لك المقاعد المنتشرة هنا وهناك مكانًا هادئًا للراحة والاستمتاع بالأجواء الهادئة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1546
            ["id" => "1b31a1a0-1627-432a-b227-47de390637c6", "translation" => "The Essalem garden is a family-friendly place. The playgrounds for children are well-equipped, ensuring moments of happiness for the little ones. Visitors of all ages will enjoy the friendly atmosphere of this place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8894d304-b611-4aa6-a183-2dddaea6b203", "translation" => "Le jardin Essalem est un lieu apprécié par les familles. Les aires de jeux pour enfants sont bien aménagées, garantissant des moments de bonheur pour les plus jeunes. Les visiteurs de tout âge apprécieront l'atmosphère conviviale de ce lieu.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dc1eb1d8-d6b9-4692-adfa-7216c7b3a021", "translation" => "حديقة السلام هي مكان يُقدره الأسر. تم تجهيز مناطق اللعب للأطفال بشكل جيد، مما يضمن للأصغر سنًا لحظات من السعادة. سيستمتع الزوار من جميع الأعمار بالجو المرح والودي في هذا المكان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1547
            ["id" => "8cb86a0f-4b58-438d-a674-3b4e7d067bee", "translation" => "The Benaissa land equestrian center welcomes you to an exceptional equestrian adventure. Explore the enchanting world of fantasia and carriages, with riding lessons, horseback rides, and the opportunity to rent these majestic companions.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "30d21084-e9a0-4d80-944f-f00922575e16", "translation" => "Le centre équestre Benaissa Land vous ouvre ses portes pour une aventure équestre exceptionnelle. Découvrez l'univers enchanteur du fantasia et des calèches, avec des cours d'équitation, des balades à cheval et la possibilité de louer ces majestueux compagnons.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2d5df0ba-1a3a-4a29-a2b4-2e9c85d50dc1", "translation" => "نادي الفروسية بن عيسى لاند يرحب بكم لتجربة فريدة من نوعها في عالم الفروسية. اكتشف عالمًا ساحرًا من الفنتازيا وعربات الخيول، مع دروس ركوب الخيل ورحلات على ظهور الخيل وفرصة لاستئجار هذه الرفاق الرائعين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1548
            ["id" => "867da009-8bc4-4f5b-aa8c-40a7a4047ddb", "translation" => "Although the winds of change may blow, this lighthouse dating back to the 16th century endures as a silent guardian of the city's history, overlooking the harbor and reminding of its significance in the cultural, historical, and maritime landscape..", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d7d6914f-b0b2-4e77-a1c1-2451c6776034", "translation" => "Bien que les vents du changement puissent souffler, ce phare qui date du XVIe siècle persiste en tant que gardien silencieux de l'histoire de la ville, surplombant le port et rappelant son importance dans le panorama culturel, historique et maritime.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a4608cbe-cd22-4b73-a154-7b520832022b", "translation" => "على الرغم من أن رياح التغيير قد تعصف، إلا أن هذا المنارة التي يعود تاريخها إلى القرن السادس عشر تستمر كحارس صامت لتاريخ المدينة، متجاوزة الميناء وتذكيراً بأهميتها في المشهد الثقافي والتاريخي والبحري.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1549
            ["id" => "2c65aa9f-36c7-437a-8dd8-6afd38598f07", "translation" => "Whether you're seeking relaxation, aquatic adventures, or simply tranquility by the sea, the Sablette beach will fulfill all your expectations. Come and enjoy this wonderful beach, where natural beauty meets modern comfort for unforgettable holidays in Mostaganem.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "faa167c3-63c5-464f-9280-1ac0d2e65feb", "translation" => "Que vous soyez à la recherche de moments de détente, d'aventures aquatiques ou tout simplement de tranquillité face à la mer, la plage Sablette saura combler toutes vos attentes. Venez profiter de cette merveilleuse plage, où la beauté naturelle rencontre le confort moderne pour des vacances inoubliables à Mostaganem.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "42b20a9e-42d2-4dc0-bfa1-38b8b6cfa2ef", "translation" => "سواء كنتم تبحثون عن الاسترخاء أو مغامرات مائية أو ببساطة عن السكينة على شاطئ البحر، ستتحقق كل توقعاتكم على شاطئ صابلات. تعالوا واستمتعوا بهذا الشاطئ الرائع، حيث تلتقي الجمال الطبيعي مع الراحة الحديثة لقضاء عطلة لا تُنسى في مستغانم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1550
            ["id" => "616269a5-2ffb-436b-9d20-579bba168f19", "translation" => "This beautiful stretch of sand extends for nearly 2 kilometers in length and flourishes to about thirty meters in width. It's fine sand adds a touch of softness to this enchanting beach, perfect for relaxation and beachside activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "73a53634-7528-44b5-8127-100610d501b2", "translation" => "Cette magnifique étendue de sable s'étire sur près de 2 kilomètres de long et s'épanouit sur une trentaine de mètres de large. Son sable fin ajoute une touche de douceur à cette plage enchanteresse, propice à la détente et aux loisirs balnéaires.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b3453cfe-24e3-45b0-bfc0-238c03388a17", "translation" => "هذا الشريط الجميل من الرمال يمتد لمسافة تقرب من 2 كيلومترًا في الطول ويزدهر حوالي ثلاثين مترًا عرضًا. رماله الناعمة تضيف لمسة من النعومة لهذا الشاطئ الساحر، مما يجعله مثاليًا للاسترخاء والأنشطة الشاطئية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1551
            ["id" => "b7f59f5c-5c01-47f0-93c8-72e7912ea628", "translation" => "If you're looking for an authentic experience in the midst of nature, the Islet beach is the perfect place. Come and get lost in the raw beauty of this wild beach, where tranquility and environmental preservation promise you a unique and unforgettable experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7da0c951-cc21-4821-b55b-d340c98cff85", "translation" => "Si vous recherchez une expérience authentique en pleine nature, la plage de l'Îlot est l'endroit idéal. Venez vous perdre dans la beauté brute de cette plage sauvage, où la tranquillité et la préservation de l'environnement vous promettent une expérience unique et inoubliable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6b4ecdda-c15f-4b50-af3a-03e53b7905e6", "translation" => "إذا كنت تبحث عن تجربة أصيلة في وسط الطبيعة، فإن شاطئ الجزيرة الصغيرة هو المكان المثالي. تعال وامتحن جمال هذا الشاطئ البري، حيث تعد الهدوء والحفاظ على البيئة تجربة فريدة ولا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1552
            ["id" => "7ca4d9c4-3f05-42c9-a187-1fcbf6ddb316", "translation" => "Come and enjoy the unique beauty of the Stidia beach, a true paradise for nature lovers, fishing enthusiasts, and scuba diving enthusiasts. A place where relaxation, adventure, and exploration await you for memorable moments by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f0692279-dcd6-4a68-b147-88bb40cb1119", "translation" => "Venez profiter de la beauté unique de la plage de Stidia, un véritable paradis pour les amoureux de la nature, les amateurs de pêche et les adeptes de la plongée sous-marine. Un lieu où détente, aventure et découvertes vous attendent pour des moments mémorables en bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dabaf2ad-72b1-4903-97bf-3e25fe3be671", "translation" => "تعال واستمتع بجمال فريد لشاطئ ستيديا، وهو جنة حقيقية لعشاق الطبيعة وهواة الصيد وعشاق الغوص. مكان حيث الاسترخاء والمغامرة والاستكشاف ينتظرونك لتمضية لحظات لا تُنسى على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1553
            ["id" => "afe14cee-2b58-4dd5-8d4c-766709a0eb80", "translation" => "Welcome to the splendid beach of Sidi Mansour, an enchanting place that stretches from the Macta beach to the base of the majestic mountain crowned by the mausoleum of Sidi Mansour. Come immerse yourself in this exceptional setting, where relaxation, recreation, and nature come together to offer you an unparalleled beach experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "54d3d7e1-af2e-4e4d-90a3-d4bd451c8536", "translation" => "Bienvenue sur la splendide plage de Sidi Mansour, un lieu enchanteur s'étendant de la plage de la Macta jusqu'au pied de la majestueuse montagne surplombée par le mausolée de Sidi Mansour. Venez vous immerger dans ce cadre exceptionnel, où détente, loisirs, et nature se conjuguent pour vous offrir une expérience balnéaire incomparable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2c1e5d38-e8c6-4db3-9f89-6ddc40ae1c33", "translation" => "مرحبًا في شاطئ سيدي منصور الرائع، مكان ساحر يمتد من شاطئ المقطع إلى قاعدة الجبل الجليل الذي يتوجه مرقد سيدي منصور. تعال وانغمس في هذا الإطار الاستثنائي، حيث تتلاقى فيه الاسترخاء والترفيه والطبيعة معًا لتقديم تجربة شاطئية لا تُضاهى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1554
            ["id" => "98323d99-af05-4ae9-8ad0-f0c75a0b43b4", "translation" => "Come and relax and enjoy the pleasures of the El Mactaa beach, where nature, friendliness, and the beauty of the landscape come together to offer you unforgettable moments by the sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e03aab13-3d6f-4020-9bd3-12550effee40", "translation" => "Venez vous détendre et profiter des plaisirs de la plage El Mactaa, où la nature, la convivialité et la beauté du paysage se combinent pour vous offrir des moments inoubliables en bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d549e7a3-4bff-416d-a899-173a27b788ed", "translation" => "تعال واسترخ واستمتع بمتع الشاطئ المقطع, حيث تجتمع الطبيعة والود وجمال المشهد لتقديم لك لحظات لا تُنسى على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1555
            ["id" => "d6c8dec2-4b3d-4a17-af2c-ef705735a6f8", "translation" => "The el Amir square in Ain Tedles is an iconic and friendly place. This picturesque square is a true landmark in the heart of the city, with its majestic trees providing refreshing shade and creating an ideal setting for a leisurely stroll or a chat with friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ea663e2a-e321-48ac-834f-234f723579ee", "translation" => "La place el Amir à Aïn Tedles est un lieu emblématique et convivial. Cette place pittoresque est un véritable point de repère au cœur de la ville avec ses arbres majestueux offrant leur ombre rafraîchissante et créant un cadre idéal pour une promenade tranquille ou pour discuter avec des amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c5367329-0ac4-4f02-9441-50b33282b21b", "translation" => "ساحة الأمير في عين تادلس هي مكان رمزي وودود. هذه الساحة الخلابة هي علامة حقيقية في قلب المدينة، حيث توفر أشجارها الجليلة الظل المنعش وتخلق بيئة مثالية لنزهة هادئة أو للدردشة مع الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1556
            ["id" => "a7bb4f87-d36a-4d40-8323-e9d972796155", "translation" => "Discover the tranquility of this public garden where nature and simplicity come together to offer a little piece of paradise in the heart of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fb024ca2-dd3c-4089-99e4-5a99ca882923", "translation" => "Découvrez la quiétude de ce jardin public où la nature et la simplicité se conjuguent pour offrir un petit coin de paradis en plein cœur de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "838eea21-a3e0-42eb-8ba2-5c2e7c9abb3e", "translation" => "اكتشف هدوء هذه الحديقة العامة حيث تتلاقى الطبيعة والبساطة لتقديم قطعة صغيرة من الجنة في قلب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1557
            ["id" => "6d6748e7-94ce-4d26-bda5-967d6f7a5c5f", "translation" => "The Frachih Dahra cave, a witness to an unbearable tragedy of the past. This sadly famous place embodies the dark chapter of our history marked by the events of the 'Enfumades' on June 18, 1845.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cde20d47-2d22-47ec-945a-b689a8ed8650", "translation" => "La grotte Frachih Dahra, témoin d'une tragédie insoutenable du passé. Ce lieu tristement célèbre incarne le sombre chapitre de notre histoire marqué par les événements des Enfumades du 18 juin 1845.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7172f44b-59d8-4b4b-8f3c-aae88d063219", "translation" => "مغارة الفراشيح الظهرة, شاهد على مأساة لا تُطاق من الماضي. هذا المكان الشهير بشكل حزين يجسد الفصل المظلم في تاريخنا الذي تميز بأحداث مذبحة في 18 جوان 1845.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1558
            ["id" => "4d7b0132-24e2-47ee-9d70-30be0d739d5c", "translation" => "The Djebel Sikh monument is erected in memory of the heroic battle that took place in November 1957 near the village of Sidi Messaoud, in the municipality of Ouled Maallah. This battle was a significant military achievement in the 4th zone of the Historical Wilaya V, also known as the 'Dahra West region'.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ae142b3c-b3a7-4e29-a893-fdf1c13ab9ae", "translation" => "Le monument de Djebel Sikh est érigé en mémoire de la bataille héroïque qui s'est déroulée en novembre 1957 près du village de Sidi Messaoud, dans la commune d'Ouled Maallah. Cette bataille a été un haut fait d'armes dans la 4e zone de la Wilaya V Historique, également connue sous le nom de 'région du Dahra ouest'.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "551c647c-cdd5-4409-b20b-06bf4b5cfcee", "translation" => "نصب جبل سيخ يُقيم تخليدًا للمعركة البطولية التي وقعت في نوفمبر 1957 بالقرب من قرية سيدي مسعود في بلدية أولاد مع الله. كانت هذه المعركة إنجازًا عسكريًا كبيرًا في المنطقة الرابعة للولاية التاريخية الخامسة، المعروفة أيضًا باسم 'منطقة الظهرة الغربية'.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1559
            ["id" => "1da32cc3-ead8-48d7-90b8-f3145d80ee9c", "translation" => "Whether it's to admire the competitions, participate in equestrian activities, or simply enjoy the pleasant atmosphere, the Mostaganem equestrian club is a popular destination for horse enthusiasts and families seeking a relaxing and entertaining experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8160ba3c-d5b2-4e91-b62d-759c1f75273f", "translation" => "Que ce soit pour admirer les compétitions, participer aux activités équestres ou simplement profiter de l'atmosphère agréable, le Club Hippique de Mostaganem est une destination prisée pour les amateurs d'équitation et les familles en quête d'une expérience de détente et de divertissement.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c3d46b95-73fc-423f-98b4-2c61556ac864", "translation" => "سواء كنتم ترغبون في التعجب من المسابقات، المشاركة في الأنشطة الفروسية، أو ببساطة الاستمتاع بالأجواء اللطيفة، نادي الفروسية مستغانم هو وجهة محببة لعشاق ركوب الخيل والعائلات الباحثة عن تجربة مريحة ومسلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1560
            ["id" => "baa2ba88-0598-4fa7-aa50-a388cbd23d04", "translation" => "This place is a true oasis in the heart of the city, a place where you can escape the hustle and bustle of urban life and recharge amidst nature. This garden welcomes you with open arms for a moment of relaxation and tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "69b07aab-1856-499b-91a4-aad05f4d0ac1", "translation" => "Ce lieu est une véritable oasis au cœur de la ville, un endroit où vous pouvez échapper à l'agitation de la vie urbaine et vous ressourcer au milieu de la nature. Ce jardin vous accueille à bras ouverts pour un moment de détente et de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e5336187-07f4-46f0-996f-6f316f3ed8e3", "translation" => "هذا المكان هو واحة حقيقية في قلب المدينة، مكان يمكنك فيه الهروب من صخب الحياة الحضرية واستعادة نشاطك في وسط الطبيعة. هذه الحديقة ترحب بك بذراعي مفتوحتين لتمضية لحظة من الاسترخاء والسكينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1561
            ["id" => "7f016de8-c4e6-4a24-97a2-28e0d9bf6129", "translation" => "Whether you're seeking a moment of tranquility or an outdoor adventure, the Kerrada dam will meet all your expectations. Come and discover this gem that offers a memorable getaway away from the hustle and bustle of everyday life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7ac189aa-ad4d-4009-ba6c-d2f9f2910917", "translation" => "Que vous soyez à la recherche d'un moment de tranquillité ou d'une aventure en plein air, le barrage de Kerrada répondra à toutes vos attentes. Venez découvrir ce joyau qui offre une escapade mémorable loin du tumulte de la vie quotidienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ce686d4e-3589-438f-86dc-9df90ddd3d2d", "translation" => "سواء كنت تبحث عن لحظة من السكينة أو مغامرة في الهواء الطلق، سيجيب سد كرادة على كل توقعاتك. تعال واكتشف هذا الجوهرة التي تقدم هروبًا لا يُنسى بعيدًا عن صخب الحياة اليومية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1562
            ["id" => "9e3b2dd5-6889-4638-950d-7ae574092450", "translation" => "The small port beach provides a privileged experience for those seeking tranquility and intimacy by the sea. This place is a coastal treasure that invites you to marvel and rejuvenate in a beautiful setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b336be6c-5685-4085-9c3a-831c29df6b78", "translation" => "La plage du petit port offre une expérience privilégiée à ceux qui cherchent la quiétude et l'intimité au bord de la mer. Ce lieu est un trésor côtier qui vous invite à vous émerveiller et à vous ressourcer dans un cadre magnifique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "21672e35-400e-4e8b-8ae9-746e282fc30d", "translation" => "شاطئ الميناء الصغير يقدم تجربة مميزة لأولئك الذين يبحثون عن الهدوء على شاطئ البحر. هذا المكان هو كنز ساحلي يدعوك للإعجاب والاسترخاء في إطار جميل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1563
            ["id" => "1fea5ae8-6eee-4f62-9f5a-7267fd1e0aaa", "translation" => "The large beach of Mers El Hadjadj is a vast expanse where nature reveals all its splendor. This spacious beach is an invitation to escape by the sea, where natural beauty unfolds in the form of wide horizons.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "78c2e901-b544-46e7-ad0a-93479a1919b6", "translation" => "La grande plage de Mers El Hadjadj est une vaste étendue où la nature dévoile toute sa splendeur. Cette plage spacieuse est une invitation à l'évasion au bord de la mer, où la beauté naturelle se déploie sous forme de vastes horizons.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4495c02d-0961-4257-b0b8-b31d5684b89e", "translation" => "شاطئ مرسى الحجاج الكبير هو مساحة شاسعة حيث تكشف الطبيعة جمالها بأكمله. هذا الشاطئ الشاسع هو دعوة للهروب على شاطئ البحر، حيث تنتشر الجمال الطبيعي على شكل آفاق واسعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1564
            ["id" => "ff2e76aa-3801-45ef-b616-0ad974a3645c", "translation" => "The fishing port of Arzew is a vibrant tableau of maritime activity and the authentic essence of coastal life. The salty aromas and gentle hustle and bustle create an immersive experience that provides a real glimpse into the fishermen's way of life and their interaction with the bountiful sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ddfc0fa2-611a-4ecf-98e0-e4a99a125e25", "translation" => "Le port de pêche d'Arzew est un tableau vivant de l'activité maritime et de l'essence authentique de la vie côtière. Les arômes salins et l'agitation douce créent une expérience immersive qui offre un aperçu réel du mode de vie des pêcheurs et de leur interaction avec la mer nourricière.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b85dad6c-7353-42ff-9044-d60ed13e1264", "translation" => "ميناء أرزيو للصيد هو لوحة حية للنشاط البحري وجوهر الحياة الساحلية الأصيلة. الروائح المالحة والتداول الهادئ يخلقان تجربة غامرة تقدم نظرة حقيقية على نمط حياة الصيادين وتفاعلهم مع البحر المغذي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1565
            ["id" => "8e19157b-4613-49cd-8ec2-49fd45f976d1", "translation" => "In this intimate and picturesque setting, you can sit on the small rocks, let yourself be lulled by the sound of the waves, and marvel at the majestic panorama that unfolds before you. The Saint Michel beach, though small in size, is vast in terms of charm, tranquility, and natural beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "80725adc-a2ef-4e97-9ee4-61abd6161e1b", "translation" => "Dans ce cadre intime et pittoresque, vous pouvez vous asseoir sur les petits rochers, vous laisser bercer par le murmure des vagues et vous émerveiller devant le panorama majestueux qui s'étend devant vous. La plage Saint Michel, bien que petite en taille, est grande en termes de charme, de tranquillité et de beauté naturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3976e72e-aed3-4440-8a9d-c5852bc9abdb", "translation" => "في هذا الإطار الحميم والجميل، يمكنك الجلوس على الصخور الصغيرة، والاستماع إلى همس الأمواج والإعجاب بالمناظر الرائعة التي تمتد أمامك. شاطئ سان ميشال, على الرغم من صغر حجمه، يتميز بالسحر والهدوء والجمال الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1566
            ["id" => "3646ca92-b892-491f-85bf-8f1afd179356", "translation" => "This lighthouse is a historical gem among the oldest lighthouses in Algeria, standing proudly on the islet of Arzew, along the stunning west coast of the gulf. It holds great importance as a crucial landmark to guide ships toward the enchanting charm of Arzew.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "64d9add5-09ac-4f78-a790-d508b4c37568", "translation" => "Ce phare est un joyau historique parmi les plus anciens phares d'Algérie, se dresse fièrement sur l'îlot d'Arzew, bordant la magnifique côte ouest du golfe, il revêt une grande importance en tant que repère essentiel pour guider les vaisseaux vers le charme envoûtant d'Arzew.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5ffb24c0-f879-4a3d-9c96-43a976ff7539", "translation" => "هذا المنارة هي جوهرة تاريخية بين أقدم منارات الجزائر، تقف بفخر على جزيرة أرزيو, على طول الساحل الغربي الرائع للخليج. إنها تحمل أهمية كبيرة كعلامة معيارية حاسمة لتوجيه السفن نحو أرزيو الساحرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1567
            ["id" => "2245dbfa-32d9-4a6b-bfe3-01b0addbf64d", "translation" => "The Cap Carbon beach, although transformed, still provides a place for contemplation and connection with nature. The waves, which now come closer, create a unique atmosphere where one can observe the sea in all its power and beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2b977b29-30dc-4678-a934-3c4e003c865e", "translation" => "La plage du Cap Carbon, bien que transformée, continue d'offrir un lieu de contemplation et de connexion avec la nature. Les vagues qui s'étendent désormais plus près créent une ambiance particulière, où l'on peut observer la mer dans toute sa puissance et sa beauté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "440d23b0-42a1-4d26-b1d8-7296194c97d6", "translation" => "شاطئ رأس الكربون، على الرغم من التحولات التي طرأت عليه، يستمر في توفير مكانًا للتأمل والاتصال مع الطبيعة. الأمواج التي تقترب الآن تخلق أجواءً فريدة، حيث يمكن للشخص مراقبة البحر بكامل قوته وجماله.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1568
            ["id" => "966e8026-5e51-4d58-93b9-904d17412939", "translation" => "The Arzew beach, despite its imperfections, embodies the soul of the city's maritime life. Fishermen going about their activities, the sound of the waves, and the view of the harbor create a picturesque and authentic atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "29a651c0-2ad2-462b-b31a-782cb40a9968", "translation" => "La plage d'Arzew, malgré ses imperfections, incarne l'âme de la vie maritime de la ville. Les pêcheurs vaquant à leurs activités, le murmure des vagues et la vue sur le port créent une ambiance pittoresque et authentique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3076de40-5e03-4c88-a04d-e1662e820ca6", "translation" => "شاطئ أرزيو, على الرغم من عيوبه، يجسد روح الحياة البحرية في المدينة. الصيادون يقومون بأنشطتهم، وهمس الأمواج، وإطلالة على الميناء تخلق أجواء جميلة وأصيلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1569
            ["id" => "2d468714-f1fa-4ecf-bd3b-b015382f8c21", "translation" => "The November 1st square in Arzew is the vibrant heart of this dynamic city. Surrounded by iconic buildings and a lively atmosphere, coupled with a mix of pedestrians, street vendors, and various activities, it creates a vibrant and dynamic ambiance.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5baf934c-54fb-46b9-a06f-17b68413974c", "translation" => "La place 1er Novembre d'Arzew est le cœur palpitant de cette ville dynamique. Entourée de bâtiments emblématiques et d'une atmosphère animée couplée au mélange de passants, de vendeurs ambulants et d'activités diverses qui crée une ambiance vibrante et dynamique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c2918026-4700-4ceb-8b84-a1bcfd77f083", "translation" => "ساحة 1 نوفمبر في أرزيو هي قلب هذه المدينة النابض بالحياة. محاطة بالمباني الرمزية وجو من الحيوية، جنبًا إلى جنب مع مزيج من المشاة وباعة الشوارع وأنشطة متنوعة، مما يخلق أجواء نابضة بالحياة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1570
            ["id" => "5a20bd77-91c1-4e11-91a4-faf34cb1dd97", "translation" => "Whether you're a nature lover or simply seeking a moment of peace and escape, the Jasmine esplanade is a botanical treasure waiting to be explored. A place where fragrances, colors, and nature come together to offer a harmonious and memorable experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e4804f30-3aa3-4414-8cfb-dbe85780b944", "translation" => "Que vous soyez un amoureux de la nature ou simplement en quête d'un moment de calme et d'évasion, l’esplanade des Jasmins est un trésor végétal qui attend d'être exploré. Un lieu où les parfums, les couleurs et la nature se réunissent pour offrir une expérience harmonieuse et mémorable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "641de125-212c-4da0-9bdd-9787b6ccc57b", "translation" => "سواء كنت عاشقًا للطبيعة أم مجرد بحثًا عن لحظة من الهدوء والهروب، فإن ساحة الياسمين هو كنز نباتي ينتظر الاستكشاف. مكان حيث العطور والألوان والطبيعة تتجمع معًا لتقديم تجربة متناغمة ولا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1571
            ["id" => "2714f5dd-8cea-4887-bdae-d0e81e24b2f8", "translation" => "Nestled in an enchanting setting, the Tebbana fortress majestically emerges in the heart of the Kristel and Sidi Benyebka mountains. Dating back to the Ottoman era, this historical gem, once a semaphore, has evolved over time to become a unique place where colonial history intertwines with maritime defense.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4ac8ec9c-51bc-4729-bf53-ab89126d06f2", "translation" => "Nichée dans un cadre féérique, la forteresse de Tebbana émerge majestueusement au cœur des monts de Kristel et de Sidi Benyebka. Remontant à l'époque ottomane, ce joyau historique, autrefois un sémaphore, a évolué au fil du temps pour devenir un lieu unique où l'histoire coloniale se mêle à la défense maritime.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "250e4be7-4cc1-4b21-9f3b-55e61cbb1fa3", "translation" => "متدرجة في إطار خيالي، تبرز قلعة تبانة بكل رفاهية في قلب جبال كريستل و سيدي بن يبقى. يعود تاريخها إلى العصر العثماني، حيث تطور هذا الجوهر التاريخي على مر الزمن ليصبح مكانًا فريدًا حيث تتشابك التاريخ الاستعماري مع الدفاع البحري.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1572
            ["id" => "fdc74286-9091-49c1-bf58-51aed5ba1ddc", "translation" => "The Cap de l’Aiguille lighthouse stands as a silent witness to the advancements in coastal lighting, a sentinel that guides sailors through the waters. Its rich history and contribution to navigation make it a valuable element of the maritime heritage of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "246f98e9-d99b-4099-a740-fe7c27e1dc00", "translation" => "Le phare du Cap de l'Aiguille se tient comme un témoin silencieux des avancées de l'éclairage côtier, une sentinelle qui guide les marins à travers les eaux. Son histoire riche et sa contribution à la navigation en font un élément précieux du patrimoine maritime de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "50a67d46-3177-448f-990e-a7a03f9719e5", "translation" => "منارة رأس الإبرة تقف كشاهد صامت على تطورات الإضاءة الساحلية، حارس يوجه البحارة عبر المياه. تاريخها الغني وإسهامها في الملاحة يجعلانها عنصرًا قيمًا في التراث البحري للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1573
            ["id" => "563e9bb7-3a9e-4502-967f-99f0fd0f755c", "translation" => "This natural haven is a rarity in North Africa due to its exceptional diversity of habitats, particularly its salt marshes. The reserve harbors abundant biodiversity, with a wide variety of vegetation adapted to halophytic environments. The reserve's waters host a multitude of invertebrates and fish, contributing to the delicate balance of this ecosystem.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9b5e847b-a91b-4492-95a9-2b6862f7611a", "translation" => "Ce havre naturel est une rareté en Afrique du nord en raison de la diversité exceptionnelle de ses habitats, en particulier ses marais salés. La Réserve abrite une biodiversité foisonnante, avec une grande variété de végétation adaptée aux milieux halophiles. Les eaux de la réserve abritent une multitude d'invertébrés et de poissons, contribuant à l'équilibre délicat de cet écosystème.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ad8d9503-51ca-45e7-a0da-71d354dbb932", "translation" => "هذا الملاذ الطبيعي هو ندرة في شمال إفريقيا بسبب تنوع مستثنى لمواطنها البيئية، وخصوصا مناطق الأهوار المالحة. تضم المحمية تنوعًا حيويًا وافرًا، مع مجموعة واسعة من النباتات المتكيفة مع البيئات الملحية. مياه المحمية تستضيف متعددة من اللافقاريات والأسماك، مساهمة في التوازن الدقيق لهذا النظام البيئي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1574
            ["id" => "e3358ce1-c86b-4698-b1d6-42fd70dd26ac", "translation" => "The Kristel Park is an extensive water park that offers remarkable facilities and stunning views of the sea. Its spaces are meticulously designed, including specially designated areas for families.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0b401c5d-7cc6-4bf8-9aa1-d0d54a801e0e", "translation" => "Le Kristel Park est un vaste parc aquatique qui offre des installations remarquables et une vue imprenable sur la mer. Ses espaces sont soigneusement aménagés, comprenant des zones spécialement délimitées pour les familles.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c82b612f-3516-46c6-92fd-643827197a18", "translation" => "كريستل بارك منتزه مائي واسع يوفر مرافق ملحوظة وإطلالات رائعة على البحر. تم تصميم مساحاتها بعناية، بما في ذلك مناطق مخصصة للعائلات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1575
            ["id" => "5d818247-4342-497c-b1e0-4cefe146773d", "translation" => "Nestled in an enchanting natural setting, the Derdaza beach offers a peaceful and relaxing atmosphere. Despite its small size, it possesses a unique charm that attracts visitors in search of tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "49c912b0-004f-4138-9f54-93f5556078e1", "translation" => "Nichée dans un cadre naturel enchanteur, la plage Derdaza offre une atmosphère paisible et relaxante. Bien que de petite taille, elle possède un charme unique qui attire les visiteurs en quête de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "91ade31c-17c8-4f5e-a27b-86dde090aa40", "translation" => "يقع شاطئ دردازة في إطار طبيعي ساحر ويقدم أجواء هادئة ومريحة. على الرغم من صغر حجمه، إلا أنه يمتلك سحرًا فريدًا يجذب الزوار الباحثين عن السكينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1576
            ["id" => "004fc40d-9b43-4b6b-81a8-80d8ebbc5848", "translation" => "Visitors can stroll among the boats, immersing themselves in the authentic and lively atmosphere of the Kristel's fishing port. It's a place where maritime tradition blends with the hustle and bustle of daily activity, providing a unique glimpse of coastal life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9d6f3544-c5b9-42ce-a396-74c18a46778c", "translation" => "Les visiteurs peuvent déambuler entre les bateaux, s'imprégnant de l'ambiance authentique et animée du port de pêche de Kristel. C'est un endroit où la tradition maritime se mêle à l'effervescence de l'activité quotidienne, offrant un aperçu unique de la vie côtière.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fed92621-5cd9-40bd-9e55-c1ffcd777e6f", "translation" => "يمكن للزوار التجول بين القوارب، مستمتعين بالأجواء الأصيلة والمليئة بالحيوية في ميناء صيد كريستل. إنه مكان حيث تتداخل التقاليد البحرية مع صخب النشاط اليومي، مما يوفر نظرة فريدة على الحياة الساحلية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1577
            ["id" => "aa7d05ea-b28e-4476-b818-32830912a525", "translation" => "Although devoid of sand, this beach offers unique experiences. You can venture onto the rocks to soak in the raw natural beauty or simply sit and admire the seascape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "987d506f-e7ca-441c-98d8-c6aff5570419", "translation" => "Bien que dépourvue de sable, cette plage offre des expériences uniques. Vous pouvez vous aventurer sur les rochers pour vous imprégner de la beauté naturelle brute ou simplement vous asseoir et admirer le paysage maritime.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9b4f403f-f372-4769-9d9a-173cb3c9e9fe", "translation" => "على الرغم من عدم وجود الرمال هنا، إلا أن هذا الشاطئ يقدم تجارب فريدة. يمكنك المغامرة على الصخور للاستمتاع بجمال الطبيعة الخام أو ببساطة الجلوس والتمتع بمناظر البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1578
            ["id" => "5fb17bbf-d043-43d6-9eab-6452d0926cba", "translation" => "This public garden is a welcoming space that offers a soothing retreat in the heart of the city. Within this garden, children's playground areas add a playful touch. Swings and slides invite youngsters to have fun safely. Parents can keep an eye on their little ones while enjoying shaded benches, perfect for resting and savoring the joyful ambiance of the garden. This harmonious space provides a moment of tranquility amidst the urban hustle and bustle, making the public garden a beloved family relaxation spot for everyone.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2961a68a-433c-4bcd-8212-999988bc1f17", "translation" => "Ce jardin public est un espace accueillant qui offre une retraite apaisante au cœur de la ville. Au sein de ce jardin, des aires de jeux pour enfants ajoutent une touche ludique. Balançoires et toboggans invitent les jeunes à s'amuser en toute sécurité.Les parents peuvent surveiller leurs petits tout en profitant de bancs ombragés, parfaits pour se reposer et profiter de l'ambiance joyeuse du jardin. Cet espace harmonieux offre une parenthèse de calme au milieu de l'agitation urbaine, faisant du jardin public un lieu de détente en famille apprécié par tous.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bd187c47-f896-424a-8b2b-2a63852d2889", "translation" => "هذه الحديقة العامة هي مساحة مرحبة تقدم مأوى مهدئ في قلب المدينة. داخل هذه الحديقة، تضيف مناطق اللعب للأطفال لمسة ممتعة. تأخذ الأماكن الهزازة والزحاليق الصغار في رحلة ممتعة بأمان. يمكن للآباء مراقبة أطفالهم بينما يستمتعون بالمقاعد المظللة، مثالية للاستراحة والاستمتاع بالأجواء المرحة في الحديقة. هذه المساحة المتناغمة توفر لحظة من الهدوء في قلب صخب المدينة، مما يجعل الحديقة العامة مكانًا محببًا للاسترخاء للعائلة بالنسبة للجميع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1579
            ["id" => "d57a454a-649c-4997-bc5f-937bbb289931", "translation" => "The Ain Franine beach, a true magnet for visitors, is a golden expanse stretching for hundreds of meters. Its fine sand creates an enchanting setting that draws crowds. Although it is not monitored, its stunning beauty captivates visitors who never tire of admiring this dazzling landscape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5376caaa-5d10-4950-bd07-8cdb04494c66", "translation" => "La plage d'Aïn Franine, un véritable aimant pour les visiteurs, est une étendue dorée s'étendant sur des centaines de mètres. Son sable fin crée un cadre enchanteur qui attire les foules. Bien qu'elle ne soit pas surveillée, sa beauté saisissante fascine les visiteurs qui ne se lassent pas d'admirer ce paysage éblouissant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b72d31c9-9fcd-4f4e-b7de-b789df997102", "translation" => "شاطئ عين فرانين, مغناط للزوار حقيقي، هو مساحة ذهبية تمتد على مسافات تصل إلى مئات الأمتار. رمالها الناعمة تخلق إعدادًا ساحرًا يجذب الجماهير. على الرغم من أنها غير مراقبة، إلا أن جمالها الرائع يفتن الزوار الذين لا يملون من التعبير عن إعجابهم بهذا المنظر الباهر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1580
            ["id" => "681b31ca-76f6-4267-925f-1d646a74a1f8", "translation" => "This wild beach has a unique charm, but its winding and sometimes dangerous access should be considered. The Cap Rousseau beach is, therefore, an ideal retreat for hikers who appreciate nature and seek to marvel at pristine landscapes.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1409afdc-5c2d-4627-8585-bf39d411ffcf", "translation" => "Cette plage sauvage est d'un charme unique, mais son accès sinueux et parfois dangereux est à prendre en compte. La plage du Cap Rousseau est ainsi une retraite idéale pour les randonneurs qui apprécient la nature et cherchent à s'émerveiller devant des paysages préservés.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4b5ef042-b387-4166-897c-12fe75ae195c", "translation" => "هذا الشاطئ البري يتمتع بجاذبية فريدة، ولكن يجب مراعاة الوصول المتعرج وأحيانًا خطير. شاطئ كاب روسو هو بالتالي ملاذ مثالي لمحبي المشي لمسافات طويلة الذين يقدرون الطبيعة ويرغبون في التأمل في مناظر طبيعية نقية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1581
            ["id" => "a12fff99-65de-47f1-b3ea-2d1da23c6028", "translation" => "The Cap Moreau beach provides a beautiful landscape and a highly enjoyable coastal experience. Its access, with a descent path through the forest, can be technically demanding, but the efforts are worthwhile. Visitors are rewarded with a spectacular view.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0cfb14d6-a949-428c-b2d7-1ef393dddb2c", "translation" => "La plage du Cap Moreau offre un paysage magnifique et une expérience côtière des plus agréables. Son accès, avec un parcours descendant depuis la forêt, peut être techniquement exigeant, mais les efforts en valent la peine. Les visiteurs y sont récompensés par une vue spectaculaire.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "09bcbe99-9afc-4bf6-97db-f836ceafce23", "translation" => "شاطئ كاب مورو يقدم مناظر طبيعية خلابة وتجربة ساحلية ممتعة للغاية. يمكن الوصول إليه عبر مسار نزولي عبر الغابة، قد يكون مطلوبًا من الناحية التقنية، ولكن الجهود تستحق ذلك. يتم مكافأة الزوار بإطلالة رائعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1582
            ["id" => "6f64fd43-1b02-4491-9405-68807b02fb44", "translation" => "The Cool Park Oran is a versatile entertainment destination that offers a variety of experiences within a single complex. Here, you'll find a Castle-Park for a royal adventure, a Trampoline Park for dynamic jumps, and a Lazer-game for strategic challenges.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5e29695d-f240-45fd-bb95-7f7e6062dc33", "translation" => "Cool Park Oran est un lieu de divertissement polyvalent qui offre une variété d'expériences en un seul complexe. Vous y découvrirez un Castle-Park pour une aventure royale, un Trampoline Park pour des sauts dynamiques et un Lazer-game pour des défis stratégiques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e638ed6b-3045-42c1-9b8a-906728e0fcc7", "translation" => "كول بارك وهران هو مكان ترفيه متعدد الاستخدامات يقدم مجموعة متنوعة من التجارب في مجمع واحد. ستجد هنا كاستل بارك لمغامرة ملكية، و ترامبولين بارك للقفزات الديناميكية، و ليزربارك للتحديات الاستراتيجية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1583
            ["id" => "5defc154-367c-4b58-ae54-8884f79b0b7c", "translation" => "The Aqua-Dive diving club is the perfect place to safely explore the underwater world. Whether it's for a family introductory experience with your children or for an outing with friends, Aqua-Dive provides exciting opportunities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8e002a29-3e81-4f04-bff7-7136fd0d136f", "translation" => "Le club de plongée Aqua-Dive est le lieu idéal pour explorer le monde sous-marin en toute sécurité. Que ce soit pour une expérience de baptême en famille avec vos enfants ou pour une sortie entre amis, Aqua-Dive offre des opportunités passionnantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "676e15ac-6f37-44ad-9e92-5b54261be374", "translation" => "نادي الغوص أكوا دايف هو المكان المثالي لاستكشاف عالم تحت الماء بأمان. سواء كنت تبحث عن تجربة تعريفية للعائلة مع أطفالك أو للخروج مع الأصدقاء، يقدم أكوا دايف فرصًا مثيرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1584
            ["id" => "0a623f72-a4e3-4838-92f9-23847ff1ba34", "translation" => "The Ahmed Medghari craft center is a dedicated space for exhibiting artworks. Handcrafted creations come to life in this space, providing visitors with a unique opportunity to appreciate the talent and creativity of artisans.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "befeab6c-880a-47fe-885f-cda4e1384e38", "translation" => "Le centre de l'artisanat Ahmed Medghari est un espace dédié à l'exposition d'œuvres. Les créations artisanales prennent vie dans cet espace, offrant aux visiteurs une opportunité unique d'apprécier le talent et la créativité des artisans.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3b6d2894-8c5e-48b6-a7db-f6d394637063", "translation" => "مركز الحرف اليدوية أحمد مدغاري هو مكان مخصص لعرض الأعمال الفنية. تأتي الإبداعات الحرفية إلى الحياة في هذا المكان، مما يوفر للزوار فرصة فريدة لتقدير موهبة وإبداع الحرفيين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1585
            ["id" => "b7b0fb5e-e0f7-49bc-86ed-71c38493833a", "translation" => "Whether you're looking for a unique memento, a special gift, or simply curious to explore local craftsmanship, the Oran crafts and trades chamber is a window into the talent, culture, and history of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "28d7a722-f898-4337-bfc7-75649ff6952e", "translation" => "Que vous soyez à la recherche d'un souvenir unique, d'un cadeau spécial ou simplement curieux de découvrir l'artisanat local, la chambre de l'artisanat et des métiers d'Oran est une fenêtre ouverte sur le talent, la culture et l'histoire de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bd79fbbb-78b9-4aff-a95b-9054154a7a6a", "translation" => "سواء كنت تبحث عن تذكار فريد، هدية خاصة، أو مجرد فضول لاستكشاف حرفيّة المنطقة المحلية، تُعتبر غرفة الحرف والصناعات في وهران نافذة إلى موهبة وثقافة وتاريخ المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1586
            ["id" => "fd8121c8-18fc-4e82-b937-ef50e67becb4", "translation" => "The statue of Ahmed Zabana is much more than a mere sculptural representation. It is a powerful symbol that conveys a message of unity, resilience, and determination. It serves as a reminder to present and future generations of the sacrifices made to achieve national sovereignty and independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "67903a97-d64d-4b4c-beaf-e76e3b15ef5a", "translation" => "La statue d'Ahmed Zabana est bien plus qu'une simple représentation sculpturale. C'est un symbole puissant qui transmet un message d'unité, de résilience et de détermination. Elle rappelle aux générations présentes et futures les sacrifices consentis pour obtenir la souveraineté nationale et l'indépendance.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d56c3649-c3d9-49e1-8394-8773f8f526d5", "translation" => "تمثال أحمد زبانة ليس مجرد تمثيل نحتي بل هو رمز قوي ينقل رسالة عن الوحدة والصمود والعزيمة. إنه يذكّر الأجيال الحالية والمستقبلية بالتضحيات التي قدمت لتحقيق السيادة الوطنية والاستقلال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1587
            ["id" => "41b366e3-7d61-4392-a8c0-42f6a1e4cc3d", "translation" => "The small Miramar carousel provides a pleasant outing for parents and their children. Despite its modest size, it offers an hour of entertainment where one can enjoy various attractions and savor sweet delights, creating pleasant and joyful memories for the younger ones.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4cb79412-d29d-42ff-82af-28c3fdf57e3f", "translation" => "Le petit manège Miramar constitue une sortie agréable pour les parents et leurs enfants. Malgré sa taille modeste, il offre une heure de divertissement où l'on peut profiter de différentes attractions et goûter à des délices sucrés, créant ainsi des souvenirs plaisants et joyeux pour les plus jeunes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "75a08ab2-47ad-4514-8a8a-2909faeb245e", "translation" => "ماناج ميرامار الصغير نزهة ممتعة للآباء وأطفالهم. على الرغم من حجمها المتواضع، إلا أنها توفر ساعة من الترفيه حيث يمكن للزوار الاستمتاع بمختلف الألعاب وتذوق الحلويات اللذيذة، مما يخلق ذكريات سعيدة وممتعة للأصغر سناً.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1588
            ["id" => "012524dd-cc6a-4970-876c-168b8d678e4e", "translation" => "The Thuveny square, located in the vibrant heart of the city of Oran, is a poignant testimony to the vital importance of green spaces. Once an enchanting garden, this exceptional place has seen less glorious days, but its potential is still there, waiting to be revitalized for the enjoyment of visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f4509d01-1bdb-495b-b1fd-3f838223b968", "translation" => "Le square maître Thuveny, situé au cœur vibrant de la ville d'Oran, est un témoignage poignant de l'importance vitale des espaces verts. Jadis un jardin enchanteur, ce lieu exceptionnel a connu des jours moins radieux, mais son potentiel est toujours là, attendant d'être ravivé pour le plus grand plaisir des visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b3a60f07-c081-453e-89d3-143580789beb", "translation" => "ساحة توفاني, الموجودة في قلب مدينة وهران النابضة بالحياة، هي شاهد مؤثر على أهمية الأماكن الخضراء. كانت فيما مضى حديقة ساحرة، وقد شهد هذا المكان الاستثنائي أيامًا أقل سطوعًا، لكن إمكانيته ما زالت هناك، في انتظار أن تعود للحياة لسرور الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1589
            ["id" => "c62d10f1-efc6-4d1b-95d1-67fd106cbcca", "translation" => "The Yves Saint Laurent residence in Oran, now a museum, is a place that pays tribute to the creator's invaluable legacy. It is a unique opportunity to appreciate his artistic genius and his impact on the world of fashion while exploring a space imbued with timeless aesthetics.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "55b50ae1-55c3-406f-b6b7-75598d3e1728", "translation" => "La résidence Yves Saint Laurent à Oran, désormais musée, est un lieu qui rend hommage à l'héritage inestimable du créateur. C'est une occasion unique d'apprécier son génie artistique et son impact sur le monde de la mode, tout en explorant un espace imprégné d'une esthétique intemporelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "21e4b698-8aab-46b8-8471-7a03717245f7", "translation" => "إقامة إيف سان لوران في وهران، والتي أصبحت الآن متحفًا، هي مكان يكرم إرث المبدع اللافت للنظر. إنها فرصة فريدة لتقدير عبقريته الفنية وتأثيره على عالم الموضة، مع استكشاف مساحة مشبعة بجماليات خالدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1590
            ["id" => "f9ec87f4-1f1d-4213-8815-0a1bca54c67e", "translation" => "The exhibition room of photos of the revolution's martyrs invites visitors to remember, honor, and draw inspiration from the sacrifice of these heroes. It's a poignant reminder of the importance of preserving history and celebrating the courage of those who contributed to forging the path towards a free and equitable future.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b2885794-b2a3-48a4-81ba-07e4f631d83b", "translation" => "L'exposition des photos des martyrs de la révolution invite les visiteurs à se souvenir, à honorer et à s'inspirer du sacrifice de ces héros. C'est un rappel poignant de l'importance de préserver l'histoire et de célébrer le courage de ceux qui ont contribué à forger le chemin vers un avenir libre et équitable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "48154b22-7a7c-47bc-9821-8b7155e349e6", "translation" => "معرض صور شهداء الثورة يدعو الزوار إلى التذكر والتكريم والاستلهام من تضحية هؤلاء الأبطال. إنه تذكير مؤثر بأهمية الحفاظ على التاريخ والاحتفال بشجاعة الذين ساهموا في صقل الطريق نحو مستقبل حر وعادل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1591
            ["id" => "270d5939-e8d8-4f5e-b0ae-c4f63842251b", "translation" => "The El Morchid garden is an oasis of serenity in the heart of the city. This enchanting place invites peaceful escape, providing a refuge of greenery and tranquility away from the urban hustle and bustle.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "611dbc33-1ada-4992-adec-bd342700656b", "translation" => "Le jardin el Morchid est une oasis de sérénité au cœur de la ville. Ce lieu enchanteur invite à une évasion paisible, offrant un refuge de verdure et de calme loin de l'agitation urbaine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4013ff06-a146-4e0a-a9b1-19bd77e11a7c", "translation" => "حديقة المرشد هي واحة للسكينة في قلب المدينة. هذا المكان الساحر يدعو إلى هروب هادئ، ويوفر مأوىً من الخضرة والهدوء بعيدًا عن صخب الحياة الحضرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1592
            ["id" => "03455904-a62f-4465-a1fd-08aaa41de4ac", "translation" => "The museum of the mujahid in Oran is a place that honors the heroism and dedication of those who fought for independence. In this museum, history comes to life through artifacts, documents, and testimonies, providing an immersive glimpse into the revolutionary period.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d48fd61b-b52e-46c4-96b9-842c202a2bca", "translation" => "Le musée du Moudjahid à Oran est un lieu qui honore l'héroïsme et le dévouement de ceux qui ont lutté pour l'indépendance. Dans ce musée, l'histoire prend vie à travers des artefacts, des documents et des témoignages, offrant un aperçu immersif de la période de la révolution.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9eb4ede0-5e4c-4daa-8110-e046f4d4774c", "translation" => "متحف المجاهد في وهران هو مكان يكرم بطولة وتفاني الذين قاتلوا من أجل الاستقلال. في هذا المتحف، تأتي التاريخ إلى الحياة من خلال القطع الأثرية والوثائق والشهادات، مما يوفر لمحة غامرة عن فترة الثورة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1593
            ["id" => "18885669-cf63-400f-8205-717101c1d6f1", "translation" => "Featuring a variety of playful attractions, the Kiddy Garden provides a safe and entertaining space for children to let loose and explore. The park is a true delight for young adventurers, offering them a complete play experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6eac723c-0981-42f2-a9c0-7b2483f283a2", "translation" => "Doté d'une variété d'attractions ludiques, Kiddy Garden propose un espace sûr et divertissant où les enfants peuvent se défouler et explorer. Le parc est un véritable plaisir pour les petits aventuriers, leur offrant une expérience de jeu complète.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "aae3ec66-5d8f-4527-92a8-02976081ebda", "translation" => "مع مجموعة متنوعة من الألعاب الترفيهية، يقدم كيدي ڨاردن مكانًا آمنًا وممتعًا للأطفال حيث يمكنهم التفكير والاستكشاف. إن الحديقة متعة حقيقية للمغامرين الصغار، حيث توفر لهم تجربة لعب شاملة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1594
            ["id" => "ebe6c394-f16f-4baa-83ee-b2fe12e7169e", "translation" => "The Aquatica by Rodina offers a thrilling day filled with family-shared memories. The water slides, cleanliness, and the courtesy of the staff will enhance your experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "13d98e62-efa3-4956-ba0f-2a413678a909", "translation" => "Aquatica by Rodina offre une journée sensationnelle, riche en souvenirs partagés en famille. Les toboggans, la propreté et la courtoisie du personnel enrichiront votre expérience.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7b442c42-8121-48dd-8eee-a9d86ce5379a", "translation" => "أكواتيكا تقدم يومًا مثيرًا مليئًا بذكريات تتشاركها مع العائلة. سيزين الزحاليق ونظافة المكان وأدب الموظفين تجربتك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1595
            ["id" => "099a6fc8-b126-4377-af83-d5b898310b1d", "translation" => "Though this garden may be modest, it testifies to the significance of green spaces in the urban fabric. It's a place where residents come together to escape the hustle and bustle of daily life, reconnect with nature, and find a moment of peace and contemplation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f7422b6c-6828-4a50-a2fa-637252eb2a5a", "translation" => "Bien que ce jardin soit modeste, il témoigne de l'importance des espaces verts dans le tissu urbain. C'est un endroit où les habitants se retrouvent pour s'échapper du tumulte de la vie quotidienne, se reconnecter avec la nature et trouver un moment de calme et de contemplation.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e3866d3c-88b0-4713-8d9f-3b1a1bb1e706", "translation" => "على الرغم من أن هذه الحديقة قد تكون متواضعة، إلا أنها تشهد على أهمية الأماكن الخضراء في النسيج الحضري. إنها مكان يجتمع فيه السكان للهروب من صخب الحياة اليومية، وإعادة الاتصال بالطبيعة، والعثور على لحظة من السكينة والتأمل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1596
            ["id" => "eb2bb84a-92c0-4b24-80f5-81fa5f1e0cf0", "translation" => "The fishing port of Oran is not only a place of work but also a reflection of maritime life and local culture. It's a place where you can immerse yourself in the world of fishermen, feel the spirit of the sea, and admire the hard work and pride of those who depend on its resources.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7f169645-9826-4131-8eaa-9e83728e6818", "translation" => "Le port de pêche d'Oran n'est pas seulement un lieu de travail, mais aussi un reflet de la vie maritime et de la culture locale. C'est un endroit où vous pouvez vous immerger dans le monde des pêcheurs, sentir l'esprit de la mer et admirer le dur labeur et la fierté de ceux qui dépendent de ses ressources.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "318784ec-aaf7-47bb-ac6d-6a5352175836", "translation" => "ميناء الصيد في وهران ليس مكان عمل فقط، بل هو أيضًا انعكاس لحياة البحر والثقافة المحلية. إنه مكان يمكنك فيه أن تتوغل في عالم الصيادين، وتشعر بروح البحر، وتعجب بالجهد الشاق والفخر لأولئك الذين يعتمدون على موارده.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1597
            ["id" => "289c79fe-0dcb-437d-af5b-fe9ee42d0cf6", "translation" => "Immerse yourself in the enchantment of the El Othmania garden, a haven of tranquility nestled on Khemisti street, across from Cayla square. After a brief closure, this green paradise has reopened, bringing joy to locals and travelers in search of escape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "425fbcff-b2ca-4800-8b88-8cb49a921c77", "translation" => "Plongez dans l'enchantement du jardin d’el Othmania, un havre de tranquillité niché à la rue Khemisti, en face du square Cayla. Après une brève fermeture, ce paradis verdoyant a rouvert ses portes, suscitant la joie des riverains et des voyageurs en quête d'évasion.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "34b38b35-ad3f-4e64-b9b2-39ad0720320f", "translation" => "انغمس في سحر حديقة العثمانية، واحة هادئة متواجدة في شارع خميستي، مقابل ساحة كايلا. بعد إغلاق مؤقت، أعادت هذه الجنة الخضراء فتح أبوابها، مما أثار فرحًا بين السكان المحليين والمسافرين الباحثين عن الهدوء,", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1598
            ["id" => "cd0fd116-307d-4021-b91c-7b61d46357d0", "translation" => "Whether you're a nature enthusiast, an eager explorer in search of discoveries, or simply seeking a place to recharge, the Seddikia garden welcomes you to enjoy a memorable getaway along the gentle waves of the Oran's coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e44cc452-a975-402e-9d0e-049df3be00ad", "translation" => "Que vous soyez un amoureux de la nature, un explorateur avide de découvertes ou simplement en quête d'un endroit où vous ressourcer, le jardin Seddikia vous ouvre ses portes pour vous offrir une escapade mémorable le long des vagues caressantes de la corniche oranaise.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a0bd5ffc-4df5-4ef0-bb3e-1bcf0b234fa5", "translation" => "سواء كنت من عشاق الطبيعة، مكتشف حماسي يبحث عن اكتشافات جديدة، أو مجرد من يبحث عن مكان للاسترخاء، ترحب بك حديقة الصديقية لتقديم لك فرصة لقضاء رحلة لا تُنسى على طول أمواج الكورنيش الوهراني.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1599
            ["id" => "744b64b4-86c5-4ced-a9cf-ebd0f61c5469", "translation" => "Whether you're an art enthusiast, passionate about design, or simply in search of products that push the boundaries of convention, the Atelier 31 is the place where you can feed your imagination and discover unexpected treasures.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "584aaf4f-feb1-4ed0-af0e-bc4baac32880", "translation" => "Que vous soyez amateur d'art, passionné de design ou simplement à la recherche de produits qui repoussent les limites de la convention, l'Atelier 31 est l'endroit où vous pourrez nourrir votre imagination et découvrir des trésors inattendus.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4605f934-f0e3-49ea-9f14-dd7d7f00f03b", "translation" => "سواء كنت عاشقًا للفن، مهووسًا بالتصميم، أو مجرد من يبحث عن منتجات تدفع حدود التقليد، يعد هذا المعرض الفني المكان الذي يمكنك من خلاله تغذية خيالك واكتشاف كنوز غير متوقعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1600
            ["id" => "ef081e7a-8e75-42e8-a07c-410a35530ab8", "translation" => "Whether you're an avid art enthusiast or simply in search of inspiration, the Sefart Gallery offers you a visual and emotional journey that will resonate long after your departure.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f0f357b6-671b-423b-8787-950c661dbac2", "translation" => "Que vous soyez un fervent amateur d'art ou simplement en quête d'inspiration, la galerie Sefart vous offre un voyage visuel et émotionnel qui résonnera longtemps après votre départ.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0b257af2-63b3-423a-bca4-5c0fb6db0fa6", "translation" => "سواء كنت عاشقًا متحمسًا للفن أو ببساطة تبحث عن الإلهام، يقدم لك هذا المعرض الفني رحلة بصرية وعاطفية ستتردد صداها لفترة طويلة بعد مغادرتك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1601
            ["id" => "3256773c-2108-444e-9188-23413380ea57", "translation" => "The Trouville beach welcomes you with a warm and family-friendly atmosphere. Its crystal-clear waters invite you to a refreshing swim, an experience you must live for yourself to appreciate its clarity and quality. You'll discover a clean and secure place, with guarded parking that ensures your peace of mind.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fab95077-7195-4863-84cb-26f759314c43", "translation" => "La plage Trouville vous ouvre les bras dans une ambiance chaleureuse et familiale. Ses eaux cristallines vous invitent à une baignade rafraîchissante, une expérience que vous devez vivre par vous-même pour en apprécier toute la clarté et la qualité. Vous découvrirez un lieu propre et sécurisé, avec un parking gardé qui assure votre tranquillité d'esprit.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bbd3e24c-396a-49de-953f-16814cb13db1", "translation" => "شاطئ تروفيل يرحب بك بأجواء دافئة وعائلية. مياهه الصافية تدعوك للسباحة المنعشة، تجربة يجب أن تعيشها بنفسك لتقدر وضوحها وجودتها. ستكتشف مكانًا نظيفًا وآمنًا، مع موقف سيارات محروس يضمن راحة بالك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1602
            ["id" => "a19f149e-4da9-4b8c-af7b-d85537a1be3c", "translation" => "Whether you're looking for a day of family leisure or simply a peaceful solo escape, the Bouisseville beach is a place where you can immerse yourself in the tranquility of the sea and marvel at the beauty of the Algerian coast.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "45e82f5c-d417-453a-b497-ac6b754e9ccc", "translation" => "Que vous soyez à la recherche d'une journée de loisirs en famille ou simplement d'une échappée paisible en solitaire, la plage Bouisseville est un endroit où vous pouvez vous immerger dans la tranquillité de la mer et vous émerveiller devant la splendeur de la côte algérienne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3d71d198-1391-4be9-96f2-4899046b1e8a", "translation" => "سواء كنت تبحث عن يوم ترفيهي مع العائلة أو ببساطة هروبًا هادئًا منعزلًا، شاطئ بوزفيل هو المكان الذي يمكنك أن تنغمس فيه في هدوء البحر وتتعجب أمام روعة الساحل الجزائري.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1603
            ["id" => "4e264655-d8ac-4716-a2c1-eb7151fbc739", "translation" => "The Paradis beach truly lives up to its name with its breathtaking landscapes, exemplary cleanliness, and serene atmosphere. It provides a sanctuary for the soul and a place to connect with the beauty of the surrounding nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e8809c4e-ece5-4c3c-a5a4-9ab3d12d6942", "translation" => "La plage Paradis mérite son nom avec ses paysages magnifiques, sa propreté exemplaire et son atmosphère sereine. Elle offre un refuge pour l'âme et un endroit où l'on peut se connecter à la splendeur de la nature environnante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fe8dfac9-eef6-46cf-9a0a-5273cfc8c8a7", "translation" => "شاطئ الجنة حقًا يستحق اسمه بمناظره الخلابة ونظافته المثالية وجوه السكون. إنه يوفر مأوى للروح ومكانًا يمكن فيه أن نتواصل مع جمال الطبيعة المحيطة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1604
            ["id" => "f05042ae-4ac0-4bd8-a944-7032714a22b5", "translation" => "The Clairefontaine beach is a place where natural beauty harmoniously blends with the surrounding calmness. It invites you to escape the daily hustle and bustle and connect with nature in all its splendor.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "00659797-81d1-4810-a4d4-92f4a170c210", "translation" => "La plage de Clairefontaine est un endroit où la beauté naturelle se marie harmonieusement avec le calme environnant. Elle vous invite à échapper à l'agitation quotidienne et à vous connecter à la nature dans toute sa splendeur.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6559fb51-fc6f-4033-9e52-e3a3a0d54280", "translation" => "شاطئ كليرفونتين هو مكان حيث الجمال الطبيعي يمتزج بانسجام مع هدوء المحيط المحيط به. إنه يدعوك للهروب من صخب الحياة اليومية والاتصال بالطبيعة بكل روعتها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1605
            ["id" => "c465f9e4-b903-4b21-ad0c-007e05e01dc0", "translation" => "Whether you're in search of a solo getaway or a family day by the sea, this beach provides you with a tranquil spot to create cherished memories and enjoy the simple beauty of seaside life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4c3d780e-ee5c-4f55-9cfa-2a36509d7d66", "translation" => "Que vous soyez en quête d'une escapade en solitaire ou d'une journée en famille au bord de la mer, cette plage vous offre un coin serein pour créer des souvenirs précieux et profiter de la beauté simple de la vie en bord de mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8835abda-1df2-4d7b-b9ce-1ffaa0f37522", "translation" => "سواء كنت تبحث عن هروب منفرد أو يوم عائلي على شاطئ البحر، يوفر لك هذا الشاطئ مكانًا هادئًا لخلق ذكريات ثمينة والاستمتاع ببساطة جمال الحياة على الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1606
            ["id" => "75adc2b8-dea0-4c85-aab3-2a8a1f2a080b", "translation" => "The Dunes beach is an invitation to relaxation and contemplation. With its enchanting setting, cleanliness, and easy access, it's a destination not to be missed for those seeking a memorable beach experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "dc1db563-e90f-4d5c-883a-7b79867cb3f0", "translation" => "La plage des Dunes est une invitation à la détente et à la contemplation. Avec son cadre enchanteur, sa propreté et son accès facile, c'est une destination à ne pas manquer pour ceux qui recherchent une expérience balnéaire mémorable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c00f7525-4bd8-41db-aa85-c44b387f92e7", "translation" => "شاطئ ليدون هو دعوة للاسترخاء والتأمل. بفضل بيئته الساحرة ونظافته وسهولة الوصول إليه، إنه وجهة لا يجب تفويتها لأولئك الذين يبحثون عن تجربة شاطئية لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1607
            ["id" => "5e2ba842-ba59-4aab-a85d-0eb138c376dc", "translation" => "The Beau Sejour beach is much more than just a swimming spot. It's a complete experience that captures the essence of Oran's seaside life. With its soft sand, shallow waters, and friendly atmosphere, this beach is a little slice of paradise where you can relax, have fun, and create unforgettable memories.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c2b76e87-0e43-41d3-912d-d18f3d64e92d", "translation" => "La plage Beau Séjour est bien plus qu'un simple lieu de baignade. C'est une expérience totale qui capture l'essence de la vie balnéaire oranaise. Entre le sable doux, les eaux peu profondes et l'ambiance amicale, cette plage est un petit coin de paradis où vous pouvez vous détendre, vous amuser et créer des souvenirs inoubliables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6364a4eb-37fc-4eed-b03d-accabcef98f0", "translation" => "شاطئ بوسيجور هو أكثر من مجرد مكان للسباحة. إنه تجربة شاملة تلتقط جوهر حياة الساحل في وهران. بين الرمال الناعمة والمياه الضحلة والجو الودي، هذا الشاطئ هو قطعة صغيرة من الجنة حيث يمكنك الاسترخاء والمرح وخلق ذكريات لا تُنسى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1608
            ["id" => "3cf10320-7353-4b7e-b133-7dd2894bee70", "translation" => "Since 1834, the Cap Falcon lighthouse has stood as a monument to the history of guiding lights for sailors and as a silent witness to the technological evolution that has illuminated the region's coasts over time.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "11f757e2-27f4-4a66-84e4-9a78d84ff1b8", "translation" => "Le phare du Cap Falcon s'érige depuis 1834 comme un monument à l'histoire des feux qui ont guidé les navigateurs et comme un témoin silencieux de l'évolution technologique qui a illuminé les côtes de la région au fil du temps.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "27a8c267-54f2-43a8-bd0c-48d080e11717", "translation" => "منذ عام 1834، يقف منارة رأس فالكون كمعلم يشهد على تاريخ الأضواء التي قادت الملاحين وكشاهد صامت على التطور التكنولوجي الذي أنار سواحل المنطقة على مر الزمن.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1609
            ["id" => "00290e40-e723-4e05-9577-098a902865c3", "translation" => "The Boukaa beach is an enchanting place that offers a complete range of services. Its sea water pool is maintained in an impeccable state of cleanliness, the meals offered are satisfying, and the overall atmosphere is most pleasant.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fd32a426-eef1-48e4-8dee-6c56afa9f677", "translation" => "Le Boukâa Beach est un lieu enchanteur qui propose une gamme complète de prestations. Sa piscine d'eau de mer est maintenue dans un état de propreté irréprochable, les repas proposés sont satisfaisants et l'ambiance générale est des plus plaisantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e83b1ef6-9fff-460c-8ee5-3f7b0acfda8e", "translation" => "بقعة بيتش هو مكان ساحر يقدم مجموعة شاملة من الخدمات. يتم الاعتناء بمسبح بالمياه البحرية بشكل لا يشوبه عيب، والوجبات المقدمة مرضية، والجو العام لا يمكن إلا أن يكون ممتعًا للغاية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1610
            ["id" => "7ba25cd9-dce4-4ece-876f-e903abb22f01", "translation" => "The Cap Falcon beach is a dream destination for nature lovers and families in search of a peaceful seaside oasis. With its understated charm, welcoming waters, and breathtaking views, it remains a precious gem on the Oran coast, an invitation to recharge and savor every moment of escape.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6fca3798-1e96-4712-aded-8713a45fd8dc", "translation" => "La plage du Cap Falcon est une destination de rêve pour les amoureux de la nature et les familles en quête d'une oasis de paix au bord de la mer. Avec son charme discret, ses eaux accueillantes et sa vue à couper le souffle, elle demeure une perle précieuse sur la côte oranaise, une invitation à se ressourcer et à savourer chaque instant d'évasion.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c718fc1f-5d28-4934-8948-becfa0cda166", "translation" => "شاطئ رأس فالكون هو وجهة أحلام لعشاق الطبيعة والعائلات الباحثة عن واحة سلام على شاطئ البحر. بفضل جاذبيته المتواضعة ومياهه الدافئة ومناظره الرائعة، يظل هذا الشاطئ جوهرة ثمينة على ساحل وهران، دعوة للتجديد والاستمتاع بكل لحظة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1611
            ["id" => "6536371e-587b-40e6-a78f-e90063fa2e40", "translation" => "The 20th of August square in Ain el Turk is a lively and dynamic place that exudes the essence of local life. This square is the hub of activity, a meeting point where the community gathers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e4c5417a-2add-40b0-bcb5-cb0ad9006784", "translation" => "La place 20 Août à Aïn el Turk est un lieu animé et dynamique qui respire l'essence de la vie locale. Cette place est le cœur de l'activité, un point de rencontre où la communauté se réunit.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0c0322c4-be86-4f2d-b556-f93660f74866", "translation" => "ساحة 20 اوت في عين الترك هي مكان حيوي ودينامي ينبض بجوهر الحياة المحلية. تعتبر هذه الساحة قلب النشاط، نقطة التقاء حيث يتجمع المجتمع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1612
            ["id" => "2b498fff-da7a-4bc2-83a8-a2cc41ac6c59", "translation" => "The Vassas square reflects the cultural diversity and authenticity of the region. Whether you want to mingle with the locals, explore local culinary delights, or simply immerse yourself in the vibrant atmosphere, this square is a window into the dynamic and exciting everyday life of Ain el Turk.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d6bb744d-6f0d-4cc3-bdcf-6cef52ceabf1", "translation" => "La place Vassas est un reflet de la diversité culturelle et de l'authenticité de la région. Que vous souhaitiez vous mêler aux habitants, explorer les délices culinaires locaux ou simplement vous imprégner de l'atmosphère vibrante, cette place est une fenêtre sur la vie quotidienne dynamique et passionnante d'Aïn el Turk.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "16f3c66c-fc92-413e-80be-ca88ac5a642a", "translation" => "ساحة فاساس هي عبارة عن انعكاس للتنوع الثقافي والأصالة في المنطقة. سواء كنت ترغب في التواصل مع السكان المحليين، استكشاف لذائذ المأكولات المحلية، أو ببساطة التمتع بالأجواء المفعمة بالحيوية، فإن هذه الساحة تعتبر نافذة على الحياة اليومية الدينامية والمثيرة في عين الترك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1613
            ["id" => "275275d4-7d7a-4851-893c-620df5724a4f", "translation" => "At the heart of this haven of tranquility, specially designed attractions for children light up their eyes with wonder, making it a true haven for budding adventurers, a sanctuary for parents, and a living canvas of shared happiness.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7515e70f-1beb-4eb2-b2e6-12e3521d6236", "translation" => "Au cœur de ce havre de tranquillité, des attractions spécialement conçues pour les enfants font briller leurs yeux d'émerveillement, ce qui en fait un véritable refuge pour les aventuriers en herbe, un sanctuaire pour les parents et un tableau vivant de bonheur partagé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1094d691-4aa4-4b0c-880e-ba8d2ac62516", "translation" => "في قلب هذا مأوى السكينة، تُضيء اللعب المصممة خصيصًا للأطفال تجعل أعينهم تتألق بالدهشة, مما يجعلها مأوى حقيقي للمغامرين الصغار، ملاذًا للآباء وأمهاتهم، ولوحة حية للسعادة المشتركة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1614
            ["id" => "a99194c6-1dd3-4ed1-80b2-424bbd8344d9", "translation" => "The Bousfer beach is a true gem of cleanliness and serenity, the perfect place for an unforgettable seaside experience. For your convenience, you have the option to rent umbrellas with accompanying tables and chairs, allowing you to fully enjoy every moment.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "69deacf4-7516-4bed-8ef1-903e55db50c4", "translation" => "La plage de Bousfer est un véritable joyau de propreté et de sérénité, l'endroit parfait pour une expérience balnéaire inoubliable. Pour votre confort, vous avez la possibilité de louer des parasols accompagnés de tables et de chaises, vous permettant ainsi de profiter pleinement de chaque instant.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b5bfeae4-456a-45aa-b92d-7d8073f11df3", "translation" => "شاطئ بوسفر هو جوهر حقيقي للنظافة والهدوء، المكان المثالي لتجربة شاطئية لا تُنسى. من أجل راحتك، لديك إمكانية استئجار مظلات مزودة بطاولات وكراسي، مما يتيح لك الاستمتاع بكل لحظة بشكل كامل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1615
            ["id" => "a061f000-da83-45c1-aced-a0ef00865a30", "translation" => "While this beach may be small, it provides an intimate and unspoiled atmosphere, exuding a tranquil ambiance, perfect for escaping the city's hustle and bustle.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1ba9b848-b5e5-43ce-8957-1d0cbd0492cc", "translation" => "Bien que cette plage soit petite, elle offre une atmosphère intime et préservée et dégage une ambiance paisible, parfaite pour échapper à l'agitation de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ae70bdf8-2d73-42c1-ad9e-f9c589925689", "translation" => "بالرغم من صغر حجم هذا الشاطئ، إلا أنه يوفر أجواء حميمة وخالية من التلوث وينبعث منها جو هادئ، مما يجعلها مكانًا مثاليًا للابتعاد عن صخب المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1616
            ["id" => "a22101c2-c185-4e7c-86c7-52b90cbf43d2", "translation" => "The big beach is a popular family destination, especially cherished by those who enjoy venturing into the sea due to its incredibly clear and clean waters. It offers an unforgettable experience for families with its expansive stretch of sand and lively atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "36011462-d5bd-435a-90f0-44d153cb7301", "translation" => "La grande plage est une destination familiale prisée. Elle est particulièrement appréciée par ceux qui aiment s'aventurer en mer grâce à ses eaux incroyablement claires et propres. Elle offre ainsi une expérience inoubliable pour les familles avec sa vaste étendue de sable et son atmosphère animée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4deaa30d-abd3-4555-9ab0-f8dd5763dc59", "translation" => "الشاطئ الكبير هو وجهة عائلية مشهورة تحظى بتقدير كبير، و يقدرونها بشكل خاص أولئك الذين يحبون المغامرات في البحر بفضل مياهها الواضحة والنظيفة بشكل لا يصدق. بذلك، يوفر تجربة لا تُنسى للعائلات مع شاطئه الواسع وأجوائه الحيوية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1617
            ["id" => "8d439f2e-9383-4c51-854b-b085557fab7e", "translation" => "The star beach is a popular and well-loved beach destination. It provides a harmonious blend of natural beauty and liveliness. Visitors can enjoy a stunning coastline with sparkling blue waters and breathtaking views of the Mediterranean Sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "08402158-22e5-4d60-ba3d-d06991dbc6b5", "translation" => "La plage de l'Étoile est une destination balnéaire populaire et appréciée. Elle offre un mélange harmonieux de beauté naturelle et d'animation. Les visiteurs y trouvent un littoral magnifique, avec des eaux bleues étincelantes et une vue imprenable sur la mer Méditerranée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fd8fbba8-d2a3-4ea8-8da7-23329f53f8d5", "translation" => "شاطئ النجمة هو وجهة شاطئية شهيرة ومحبوبة. إنه يقدم مزيجا متناغما من الجمال الطبيعي والحيوية. يجد الزوار ساحلًا رائعًا مع مياه زرقاء ساطعة وإطلالات خلابة على البحر الأبيض المتوسط.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1618
            ["id" => "f5e074da-0bed-4817-810e-758f4d80def5", "translation" => "The Bomo beach is a true treasure, providing a stretch of fine sand and a family-friendly atmosphere. It is ideal for families as the waters are shallower, making it perfect for children. An additional advantage is the possibility of parking nearby, making access easier.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "939c11ff-9e91-475a-a4ef-4be8cbea25ba", "translation" => "La plage de Bomo est un véritable trésor, offrant une étendue de sable fin et une ambiance familiale. Elle est idéale pour les familles car les eaux sont moins profondes, ce qui la rend parfaite pour les enfants. L'avantage supplémentaire est la possibilité de stationnement à proximité, facilitant ainsi l'accès.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "834ce2d6-0453-4638-834c-067439ffe083", "translation" => "شاطئ بومو هو كنز حقيقي، حيث يوفر مساحة من الرمال الناعمة وأجواء عائلية. إنه مثالي للعائلات نظرًا لأن مياهه أقل عمقًا، مما يجعله مناسبًا للأطفال. ميزة إضافية هي إمكانية الوقوف بالسيارة بالقرب منه، مما يسهل الوصول إليه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1619
            ["id" => "31ef13cd-0125-4463-aa6c-1b2664eaad84", "translation" => "The Corales beach has been significantly degraded due to sewage-related issues, which poses an environmental catastrophe. Despite these problems, the beach still retains some of its charm, but the challenges it faces are undeniable.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5b7f43e5-3ec1-41e0-9216-4b646be021cd", "translation" => "La plage de Corales a été largement dégradée en raison problèmes liés aux égouts, ce qui représente une catastrophe pour l'environnement. Malgré ces problèmes, la plage conserve une part de son charme, mais les défis auxquels elle est confrontée sont indéniables.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d5d38f50-6230-4386-a4cc-064bebcc73dd", "translation" => "شاطئ كوراليس تعرض لتدهور كبير بسبب مشكلات تتعلق بالصرف الصحي، مما يمثل كارثة بيئية. على الرغم من هذه المشاكل، إلا أن الشاطئ لا يزال يحتفظ بجزء من جاذبيته، ولكن التحديات التي يواجهها لا يمكن إنكارها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1620
            ["id" => "f42b50bb-002e-41ff-a235-bd855da0205c", "translation" => "The Andalusians beach is a beautiful family destination, despite some challenges related to crowds and limited availability of private spaces. It still remains a pleasant option for a beach vacation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "244883fa-5f41-47d8-964c-f2880ea63f3b", "translation" => "La plage des Andalouses est une belle destination familiale, malgré quelques défis liés à la foule et à la disponibilité limitée d'espaces pour les particuliers. Elle reste une option agréable pour des vacances balnéaires.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "51bc52c3-dbec-4f26-93d4-87f814fe4a46", "translation" => "شاطئ الأندلسيات هو وجهة عائلية جميلة، على الرغم من بعض التحديات المتعلقة بالازدحام وتوافر المساحات الخاصة المحدودة. ما زال يعتبر خيارًا ممتعًا لقضاء عطلة على الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1621
            ["id" => "8882ed01-f994-4777-844f-a50fe1a54930", "translation" => "Aqua Paloma is much more than just a diving center - it's a gateway to exceptional underwater experiences. With a competent and friendly team, every moment spent here turns into a memorable adventure. You can dive with confidence, as their expertise safely guides you.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "04fb1804-37f8-495c-ae16-6e7118f325ea", "translation" => "Aqua Paloma est bien plus qu'un simple centre de plongée - c'est une porte ouverte vers des expériences sous-marines exceptionnelles. Avec une équipe compétente et souriante, chaque moment passé ici se transforme en une aventure mémorable. Vous pouvez plonger en toute confiance, car leur expertise vous guide en toute sécurité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e86bc010-2805-4bdb-9d22-c09bdda6abb5", "translation" => "أكوا بالوما ليس مجرد مركز غوص عادي - إنها بوابة إلى تجارب استثنائية تحت الماء. مع فريق ماهر وودود، يتحول كل لحظة قضيتها هنا إلى مغامرة لا تُنسى. يمكنك الغوص بثقة، حيث يوجهك خبراؤهم بأمان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1622
            ["id" => "6dcbf7d5-0e19-4f61-903b-c439090dee66", "translation" => "The Ennakhil beach is a small, peaceful beach that provides a tranquil and unspoiled setting for nature enthusiasts. With its fine sand, calm waters, and soothing ambiance, it is an ideal place for relaxation and swimming.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f4b3cfe3-f29c-4112-841b-e86409f43fe4", "translation" => "La plage Ennakhil est une petite plage paisible qui offre un cadre tranquille et préservé pour les amateurs de la nature. Avec son sable fin, ses eaux calmes et son ambiance apaisante, c'est un endroit idéal pour la détente et la baignade.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "88e1b099-0014-405b-99d1-d6530320a59d", "translation" => "شاطئ النخيل هو شاطئ صغير ومستقر يقدم بيئة هادئة وطبيعية ساحرة لعشاق الطبيعة. بفضل رماله الناعمة ومياهه الهادئة والأجواء المريحة، إنه مكان مثالي للاسترخاء والسباحة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1623
            ["id" => "a9c8f89c-a497-4e24-8497-9d4577c6e8c7", "translation" => "The view and picturesque landscape make the Pilici beach one of the most beautiful and sought-after tourist destinations in the region. It's a place where nature takes precedence, providing a peaceful haven for those seeking to escape into the beauty of the Oran coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2c449e7f-f6e6-45bc-89fb-72210a7a31c4", "translation" => "La vue et le paysage pittoresque font de la plage Pilici l'un des sites touristiques les plus beaux et prisés de la région. C'est un endroit où la nature reprend ses droits, offrant un havre de paix pour ceux qui cherchent à s'évader dans la beauté de la côte d'Oran.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4faad209-0f39-4ad4-80e4-7a521eefae22", "translation" => "الإطلالة والمناظر الخلابة تجعل شاطئ بيليسي واحدًا من أجمل وأكثر المواقع السياحية المرغوبة في المنطقة. إنه مكان حيث الطبيعة تستعيد حقوقها، مما يوفر ملاذًا هادئًا لأولئك الذين يبحثون عن الهروب إلى جمال ساحل وهران.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1624
            ["id" => "d20da745-523e-472b-b20c-fd1d5d845baf", "translation" => "The Cap Blanc beach is spacious and well-monitored, with the presence of the civil protection and the national gendarmerie. It features some scattered rocks at about 15 meters from the shore, but offers relatively clear water.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "438dd398-ef18-4980-b9b8-3f2a93e0cc59", "translation" => "La plage du Cap Blanc est spacieuse et bien surveillée, avec la présence de la protection civile et de la gendarmerie nationale. Elle présente quelques rochers dispersés à environ 15 mètres du rivage, mais offre une eau relativement pure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2bd34a58-1764-4354-aa72-57f902731016", "translation" => "شاطىء الرأس الأبيض واسع ومراقب بشكل جيد، بوجود الحماية المدنية والدرك الوطني. يتميز بوجود بعض الصخور المتناثرة على بعد حوالي 15 مترًا من الشاطئ، ولكنه يقدم مياه نسبياً نقية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1625
            ["id" => "e9f9e1e4-9884-462d-b1cd-e4cfbe4e4aa8", "translation" => "The Small port beach is a peaceful coastal gem. Nestled in an idyllic setting, it provides a tranquil haven for beach lovers. With its fine sand, calm waters, and relaxing atmosphere, it's a perfect place for swimming and relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1c205264-d03b-447f-bf82-522d5c96591d", "translation" => "La plage du Petit Port est un petit bijou côtier paisible. Nichée dans un cadre idyllique, elle offre un refuge tranquille pour les amoureux de la plage. Avec son sable fin, ses eaux calmes et son ambiance relaxante, c'est un endroit parfait pour la baignade et la détente.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dc7d1aa5-46c7-4c4f-bdab-fdf67087463b", "translation" => "شاطئ الميناء الصغير هو جوهرة ساحلية هادئة. ملتئم في إطار خلّاب، يقدم مأوى هادئ لعشاق الشاطئ. بفضل رماله الناعمة ومياهه الهادئة والأجواء الريّاحية، إنه مكان مثالي للسباحة والاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1626
            ["id" => "abdf7dae-b10f-4bf9-a0fb-9c7e3e9db224", "translation" => "The Madagh 1 beach is a fantastic beach destination, known for its safety, good infrastructure, and comprehensive facilities. It is well-monitored, with the presence of the gendarmerie, lifeguards, and firefighters. Additionally, it features a medical station, showers, and restroom facilities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1f60272d-64c6-4c17-852a-9a2133328889", "translation" => "La plage Madagh 1 est une superbe destination balnéaire, caractérisée par sa sécurité, son bon aménagement et ses équipements complets. Elle est bien surveillée, avec la présence de la gendarmerie, de maîtres nageurs et de pompiers. De plus, elle dispose d'un poste médical, de douches et de sanitaires.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e748551b-fa80-4e8d-bc15-69d8583ed9fe", "translation" => "شاطئ مداغ 1 هو وجهة شاطئية رائعة، معروفة بسلامتها وبنيتها الجيدة ومرافقها الشاملة. إنها تُراقب بشكل جيد، بوجود الدرك ورجال الإنقاذ ورجال الإطفاء. بالإضافة إلى ذلك، يتوفر بها مركز طبي وأماكن للاستحمام والمرافق الصحية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1627
            ["id" => "75e8d4f1-60f8-4525-8366-14862e3b85b5", "translation" => "The Madagh beach is recognized as one of the best beaches in the region. This place is truly enchanting, offering optimal swimming conditions. However, it's important to remain vigilant due to the presence of rocks at the water's entrance. The gently sloping sand makes swimming easy, even for the youngest, although underwater currents can be powerful. Additionally, it's worth noting that access to this beach is quite challenging, making it both an exceptional and demanding destination to reach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "97b0437a-2ce8-4ea7-b7d1-1edc59516fef", "translation" => "La plage de Madagh est reconnue comme une des meilleures plages de la région. Cet endroit est véritablement enchanteur, offrant des conditions de baignade optimales. Toutefois, il est important de rester vigilant en raison de la présence de rochers à l'entrée de l'eau. Le sable en pente douce facilite la baignade, même pour les plus jeunes, bien que les courants sous-marins puissent être puissants. De plus, il convient de noter que l'accès à cette plage est assez difficile, ce qui en fait une destination à la fois exceptionnelle et exigeante à atteindre.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1dc86e93-2cf7-416f-8448-2722c1206fc4", "translation" => "شاطئ مداغ معروف كواحد من أفضل الشواطئ في المنطقة. هذا المكان حقًا ساحر، حيث يوفر شروطًا مثلى للسباحة. ومع ذلك، من المهم أن نبقى يقظين بسبب وجود الصخور عند مدخل الماء. الرمال المائلة بلطف تجعل السباحة سهلة، حتى بالنسبة للأصغر سنًا، على الرغم من أن التيارات تحت الماء يمكن أن تكون قوية. بالإضافة إلى ذلك، يجدر بالذكر أن الوصول إلى هذا الشاطئ صعب نسبيًا، مما يجعله وجهة استثنائية وتحتاج إلى مجهود للوصول إليها.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1628
            ["id" => "b9d0327e-75af-4806-b4de-c8ffc487e789", "translation" => "The Madagh cove is an absolutely incredible place, but accessing it can be a challenge. However, the effort is well worth it for those seeking a unique wilderness experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "33612542-6df0-4640-a18f-1b799f75d5cd", "translation" => "La crique de Madagh est un lieu absolument incroyable, mais son accès peut être un défi. Cependant, l'effort en vaut la peine pour ceux qui cherchent une expérience unique en pleine nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b8141649-c0ee-4f04-92a5-b51c960e589b", "translation" => "خليج مداغ مكان لا يصدق تمامًا، ولكن الوصول إليه قد يكون تحديًا. ومع ذلك، الجهد يستحق ذلك بالنسبة لأولئك الذين يبحثون عن تجربة فريدة في الطبيعة البرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1629
            ["id" => "f6a9c219-4c08-4ea4-aa3a-7d7cff2585a2", "translation" => "For a rejuvenating escape, the Hassi Bounif thermal resort is the perfect destination. Treat yourself to a well-deserved break, unwind, and pamper yourself in this haven of tranquility. Your well-being and comfort are at the heart of this unique experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "955257a2-4930-433c-bc98-58256c7702c3", "translation" => "Pour une évasion revitalisante, la station thermale de Hassi Bounif est la destination idéale. Offrez-vous une pause bien méritée, détendez-vous et laissez-vous dorloter dans ce havre de paix. Votre bien-être et votre confort sont au cœur de cette expérience unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3f850eab-012f-457f-9a87-daf103fb9b7a", "translation" => "للهروب والاستراحة المنعشة، منتجع حاسي بونيف هو الوجهة المثلى. امنح نفسك استراحة تستحقها، استرخِ ودلل نفسك في هذا ملاذ السلام. راحتك ستكون في صدارة هذه التجربة الفريدة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1630
            ["id" => "9d70c508-ffe6-493b-9a5e-6800d867b7d1", "translation" => "The Kart Live is much more than just a karting track. It's a place where memorable memories are created, where the adrenaline of racing is felt, and where you are warmly welcomed. If you're seeking thrills and entertainment in the area, Kart Live is the perfect place for it.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1de75d4b-dbfd-4a48-95a4-4573ef49545a", "translation" => "Kart Live est bien plus qu'une simple piste de karting. C'est un endroit où l'on crée des souvenirs mémorables, où l'on ressent l'adrénaline de la course, et où l'on est accueilli chaleureusement. Si vous êtes en quête de sensations fortes et de divertissement dans la région, le Kart Live est l'endroit parfait pour cela.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "024e2096-6ad0-4822-b9da-a5be0f05663b", "translation" => "كارت لايف هو أكثر من مجرد مضمار سباق الكارتينغ. إنه مكان حيث يتم خلق ذكريات لا تُنسى، حيث يُشعر الشخص بإثارة سباق الكارتينغ، وحيث يتم الترحيب بالزوار بدفء. إذا كنت تبحث عن تجارب مثيرة وترفيه في المنطقة، فإن كارت لايف هو المكان المثالي لذلك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1631
            ["id" => "d7404d7b-c3a7-4b22-ae90-1524f0eda834", "translation" => "Surrounded by a natural environment, the Oran Paintball Adventure offers an exciting playing field where obstacles and strategic hideouts add an extra dimension to the game.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1baebc77-6281-4f86-8e7c-0edda802b458", "translation" => "Entouré par un environnement naturel, l'Aventure Oran Paintball offre un terrain de jeu passionnant, où les obstacles et les cachettes stratégiques ajoutent une dimension supplémentaire au jeu.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dbc2f594-8a14-4cb7-83c9-42451a20f4d2", "translation" => "محاط ببيئة طبيعية، باينتبول وهران يقدم ملعبًا مثيرًا حيث تضيف العقبات والمخابئ الاستراتيجية بعدًا إضافيًا للعبة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1632
            ["id" => "82ade7e9-4e1f-467d-8995-08e198f7f584", "translation" => "The Antar ibn Chaddad equestrian center is a magical place for anyone who appreciates horses and horseback riding, promising unforgettable moments in the company of these magnificent creatures.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ddb8933a-503e-4eac-aa99-082570c94af3", "translation" => "Le centre équestre Antar ibn Chaddad est un lieu magique pour tous ceux qui apprécient les chevaux et l'équitation, et il promet des moments inoubliables en compagnie de ces magnifiques créatures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d5269512-5448-40ab-b9bf-2967b5ef3856", "translation" => "مركز الفروسية عنتر بن شداد هو مكان ساحر لكل من يقدر الخيول وفنون الفروسية، ويعد بأوقات لا تُنسى برفقة هذه المخلوقات الرائعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1633
            ["id" => "e9c0ba84-afe2-4a5f-b4b2-9b1d6c6d3dd3", "translation" => "The Gharaba lake is a wetland of great significance, especially during the winter season. This place is a true paradise for waterfowl, providing a suitable habitat for a variety of fascinating species.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "fe220a34-b27a-4189-b700-fd3eca962d3a", "translation" => "Le lac Gharaba est une zone humide d'une grande importance, en particulier pendant la saison hivernale. Cet endroit est un véritable paradis pour les oiseaux d'eau, offrant un habitat propice à une variété d'espèces fascinantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e8f49d61-d2e1-4461-b601-6a31d7c3673e", "translation" => "بحيرة غرابة هي منطقة رطبة ذات أهمية كبيرة، خاصة خلال فصل الشتاء. هذا المكان هو جنة حقيقية لطيور الماء، حيث يوفر موطنًا مناسبًا لمجموعة متنوعة من الأنواع المثيرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1634
            ["id" => "c22d427f-01ff-410c-b0b4-40a48ff3cc8c", "translation" => "La Vierge swimming pool is a versatile relaxation spot where you can enjoy a refreshing swim, unwind at the cafe, or savor flavored shisha. It's an ideal place to spend quality time with friends or family, offering a range of options for entertainment and relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "efaae0e7-f346-43cf-8f4a-cb197ee89359", "translation" => "La piscine La Vierge est un lieu de détente polyvalent où vous pouvez profiter d'une piscine rafraîchissante, vous détendre au café ou savourer une chicha parfumée. Un endroit idéal pour passer du temps agréable entre amis ou en famille, offrant une gamme d'options pour vous divertir et vous relaxer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "aa36291b-b3da-443e-b05c-d52221e88bc2", "translation" => "مسبح مسرغين هو مكان للاسترخاء متعدد الاستخدامات حيث يمكنك الاستمتاع بالسباحة المنعشة، أو الاستراحة في الكافيه، أو التمتع بالشيشة المعطرة. إنه مكان مثالي لقضاء وقت ممتع مع الأصدقاء أو العائلة، حيث يقدم مجموعة من الخيارات للتسلية والاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1635
            ["id" => "6c0eee84-d6af-4a1c-8bfd-e921657a519c", "translation" => "The Misserghine square is a pleasant place to spend time in the shade, chat with friends, or simply have a moment of outdoor tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "df979b10-3cdf-40eb-9af8-74c53a50e3d5", "translation" => "La placette Misserghine est un endroit agréable pour passer du temps à l'ombre, discuter avec des amis ou simplement prendre un moment de tranquillité en plein air.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f3b6e7f1-cb7f-4566-a5c1-d9f4b7f3ad3b", "translation" => "ساحة مسرغين هي مكان لطيف لقضاء وقت في الظل، التحدث مع الأصدقاء، أو ببساطة قضاء لحظة من السكينة في الهواء الطلق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1636
            ["id" => "d3221b21-6985-46c6-8038-bae7e3393096", "translation" => "The Boutlelis public garden is a green and peaceful space in the heart of the city. It provides an ideal relaxation spot for residents and visitors alike.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d05a9a9e-50a2-4e5e-ae04-08e00e0451d5", "translation" => "Le jardin public de Boutlelis est un espace verdoyant et paisible au cœur de la ville. Il offre un lieu de détente idéal pour les habitants et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bae50223-77f0-4c91-a1dd-a4c5433d83bb", "translation" => "حديقة بوتليليس العامة هي مساحة خضراء هادئة في قلب المدينة. إنها توفر مكانًا مثاليًا للراحة للمقيمين والزوار على حد سواء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1637
            ["id" => "1ac87b59-30fb-4554-b925-dbccf0e47bc8", "translation" => "The Habibas Islands are a true sanctuary for the fauna and flora of the Mediterranean. It's an exceptional place for nature enthusiasts, offering a rare glimpse of the preserved natural beauty of this region. The location has been classified as a maritime nature reserve by UNESCO since 2003.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "53959cf8-f222-41dd-bbcf-d5ccc0b22a61", "translation" => "Les îles Habibas sont un véritable sanctuaire pour la faune et la flore de la Méditerranée. C'est un lieu exceptionnel pour les amateurs de nature offrant un aperçu rare de la beauté naturelle préservée de cette région. L’endroit est classé comme réserve naturelle maritime par l'UNESCO depuis 2003.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f6784393-1039-4fde-9cf6-2d88dbdc4f03", "translation" => "جزر حبيبة هي ملاذ حقيقي للحياة البرية والنباتات في منطقة البحر الأبيض المتوسط. إنها مكان استثنائي لعشاق الطبيعة يقدم نظرة نادرة على الجمال الطبيعي المحفوظ في هذه المنطقة. تم تصنيف المكان كمحمية طبيعية بحرية من قبل اليونسكو منذ عام 2003.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1638
            ["id" => "7a9c21f3-5708-4a98-86ce-1b8d82d5282a", "translation" => "The Bouzedjar beach is an ideal destination for families seeking a pleasant beach experience. It stands out for its cleanliness and safety, providing ample space for visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d64670d9-ccc4-40b4-aa9b-ad370f7e4fcb", "translation" => "La plage Bouzedjar est une destination idéale pour les familles en quête d'une expérience balnéaire agréable. Elle se distingue par sa propreté et sa sécurité, offrant un espace étendu pour les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5346c5b7-d0b5-4cc9-9bb3-a909b957cc62", "translation" => "شاطئ بوزجار هو وجهة مثالية للعائلات الباحثة عن تجربة شاطئية ممتعة. يتميز بنظافته وسلامته، ويوفر مساحة واسعة للزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1639
            ["id" => "2705ba90-46f4-4d20-afd0-b0a95ba35b0f", "translation" => "The Bouzedjar fishing port is a crucial site for fishing activity in the region. It's a bustling place where fishermen gather for their daily work. The port is animated by the coming and going of fishing boats, with sailors unloading their daily catch.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bf8a6869-f81c-41a8-a150-8e71b2b6c114", "translation" => "Le port de pêche de Bouzedjar est un site essentiel pour l'activité de pêche dans la région. C'est un lieu dynamique où les pêcheurs se rassemblent pour leurs activités quotidiennes. Le port est animé par le va-et-vient des bateaux de pêche, les marins déchargeant leur prise du jour.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a7905eff-14ef-45cd-aed0-fa2462af30da", "translation" => "ميناء صيد بوزجار هو موقع أساسي لنشاط الصيد في المنطقة. إنه مكان دينامي حيث يتجمع الصيادون لأنشطتهم اليومية. يزدهر الميناء بحركة السفن الصيد، حيث يقوم البحارة بتفريغ صيدهم اليومي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1640
            ["id" => "1fe32e06-b547-48b0-ae19-e41e96883cb3", "translation" => "The Port beach is a place of impeccable cleanliness and great tranquility. However, it's best to avoid visiting on the weekends, as that's when it tends to be the most crowded. Outside of that time, it's truly a beautiful place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "89ba584d-9388-4731-a9b3-5592fd88f613", "translation" => "La plage du Port est un endroit d'une propreté irréprochable et d'une grande tranquillité. Cependant, il est préférable d'éviter d'y venir le week-end, car c'est à ce moment-là que l'endroit est le plus fréquenté. En dehors de cette période, c'est un lieu véritablement magnifique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d33a8d23-d4fa-457c-98bb-9bb09561e43c", "translation" => "شاطئ الميناء هو مكان نظيف بشكل لا يشوبه شائبة ومسالم للغاية. ومع ذلك، من الأفضل تجنب زيارته في نهاية الأسبوع، حيث يكون المكان أكثر ازدحامًا. خارج هذه الفترة، إنه مكان حقًا جميل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1641
            ["id" => "418cf6f8-96fa-4dfd-9a5d-30fc7d403e49", "translation" => "The Cap Figalo beach is a stunning turquoise cove, providing a breathtaking view from the heights. However, accessing this beach, whether by car or on foot, can be challenging. It is also possible to reach it by boat from Bouzedjar.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e469ce99-2d07-43ce-b5dd-04b28ece0b6b", "translation" => "La plage du Cap Figalo est une magnifique calanque aux eaux bleu turquoise, offrant un point de vue à couper le souffle depuis les hauteurs. Cependant, l'accès à cette plage, que ce soit en voiture ou à pied, peut être difficile. Il est aussi possible de s'y rendre en bateau depuis Bouzedjar.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8aecf664-0962-4f2e-a869-3f1c5edb3004", "translation" => "شاطئ كاب فيغالو هو منطقة خلابة بمياه زرقاء تركوازية، تقدم مناظر خلابة من الأماكن المرتفعة. ومع ذلك، الوصول إلى هذا الشاطئ، سواء بالسيارة أو سيرًا على الأقدام، قد يكون صعبًا. من الممكن أيضًا الوصول إليه بواسطة قارب من بوزجار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1642
            ["id" => "54303220-e8e3-48b7-8793-ce6ee4a1d706", "translation" => "The secluded nature of the Guitare cove makes it a peaceful and unspoiled place, ideal for nature lovers and tranquility seekers. It is hoped that this place remains clean, and the voluntary involvement of visitors in preserving this natural beauty is essential.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b3ca0385-77e6-4c46-96bf-37979aebc110", "translation" => "L'aspect isolé de la crique de la Guitare en fait un lieu paisible et préservé, idéal pour les amoureux de la nature et de la tranquillité. Il est à espérer que cet endroit reste propre, et l'implication volontaire des visiteurs dans la préservation de cette beauté naturelle est essentielle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "202ad497-5166-4673-8049-d71efa87b035", "translation" => "الطابع المنعزل لخليج الجيتار يجعله مكانًا هادئًا ومحفوظًا، مثاليًا لعشاق الطبيعة والباحثين عن الهدوء. نأمل أن يبقى هذا المكان نظيفًا، وأن المشاركة الطوعية للزوار في الحفاظ على هذا الجمال الطبيعي أمر أساسي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1643
            ["id" => "06eb28a4-4b86-4aed-9950-a7274c38b819", "translation" => "The Sbiaat beach is vast and secured by civil protection and gendarmes. This beach is truly worth the visit, even though access can be a bit challenging and requires a sturdy vehicle for the descent. However, the experience is well worth it for nature and adventure enthusiasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bbb256db-4cb0-4eb6-a4e3-1071c9dace4e", "translation" => "La plage Sbiaat est immense et sécurisée par la protection civile et les gendarmes. Cette plage vaut vraiment le détour, même si l'accès peut être un peu difficile et nécessite un bon véhicule pour la descente. Cependant, l'expérience en vaut la peine pour les amoureux de la nature et de l'aventure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "71eea8ab-9e9f-44e9-a4a5-f7aa3bb3aed6", "translation" => "شاطئ السبيعات واسع ومؤمّن بوجود الحماية المدنية ورجال الدرك. هذا الشاطئ يستحق الزيارة بالفعل، حتى على الرغم من أن الوصول إليه قد يكون قليلاً صعبًا ويتطلب وجود مركبة قوية للنزول. ومع ذلك، فإن التجربة تستحق العناء لمحبي الطبيعة والمغامرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1644
            ["id" => "a7ad888f-6861-495c-8855-6ee9abbc7280", "translation" => "The Zimba beach is an invitation to escape and discover a place of unparalleled beauty. Don't wait any longer to have an unforgettable experience in the heart of this earthly paradise.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1d0977b9-5386-4a55-a541-3c6c0d51a92f", "translation" => "La plage Zimba est une invitation à l'évasion et à la découverte d'un lieu d'une beauté incomparable. N'attendez plus pour vivre une expérience inoubliable au cœur de ce paradis terrestre.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bb066ed3-598f-4397-b165-da5fbf2604b2", "translation" => "شاطئ زيمبا هو دعوة للهروب واستكشاف مكان ذو جمال لا مثيل له. لا تنتظر أكثر لتعيش تجربة لا تُنسى في قلب هذا الجنة الدنيوية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1645
            ["id" => "6ffee50b-93d1-43ed-8c00-b112e6ab3a79", "translation" => "The Sassel beach is a peaceful and secure place with the presence of civil protection, gendarmerie, and police to ensure the safety of visitors. It offers three large interconnected beaches, providing ample space for swimmers. The beach is known for its cleanliness, and monitored parking is available for a fee.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f2f72913-63da-4941-92a7-744fad5740eb", "translation" => "La plage Sassel est un endroit paisible et sécurisé, avec une présence de la protection civile, de la gendarmerie et de la police pour assurer la sécurité des visiteurs. Elle offre trois grandes plages liées entre elles, offrant ainsi un vaste espace pour les baigneurs. La plage est réputée pour sa propreté, et un parking surveillé est disponible moyennant un tarif.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "abf12a9e-8b77-4c69-b90f-546266080d89", "translation" => "شاطئ ساسل هو مكان هادئ وآمن، بوجود الحماية المدنية ورجال الدرك والشرطة لضمان أمان الزوار. إنه يوفر ثلاثة شواطئ كبيرة متصلة ببعضها، مما يوفر مساحة واسعة للسباحين. الشاطئ معروف بنظافته، وتتوفر مرافق لصف السيارات تحت الرصد مقابل رسوم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1646
            ["id" => "a10f5764-345e-4de1-9747-b27aa23a998b", "translation" => "The Kenzi Land aquapark is a lively and secure place. You'll find a variety of games and slides, especially for children. The lifeguards are professional and ensure the safety of visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ed517c59-f71f-40c7-a38f-a18a8f86a888", "translation" => "L'Aquapark Kenzi Land est un endroit très animé et sécurisé. Vous y trouverez une variété de jeux et de toboggans, en particulier pour les enfants. Les maîtres nageurs y sont professionnels et veillent à la sécurité des visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b44f0e41-c4ab-494c-9c91-21abae17bef1", "translation" => "الحديقة المائية كنزي لاند مكان حيوي وآمن. ستجد هناك مجموعة متنوعة من الألعاب والزلاقات، خصوصًا للأطفال. الحراس محترفون ويضمنون سلامة الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1647
            ["id" => "842b05a3-9469-401d-8950-d8b2e0f9bbfd", "translation" => "The El Mordjane beach is a true gem of the Algerian coastline, a beach destination worth discovering. Nestled in an exceptional natural setting, this beach offers an unforgettable experience for visitors seeking relaxation and natural beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "478d6ab2-2c30-452d-99d1-107a0506eb3a", "translation" => "La plage d’el Mordjane est un véritable joyau du littoral algérien, une destination balnéaire qui mérite d'être découverte. Nichée dans un cadre naturel exceptionnel, cette plage offre une expérience inoubliable pour les visiteurs en quête de détente et de beauté naturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "50d61db3-f6b7-484e-9edb-6a8cf4b6875d", "translation" => "شاطئ المرجان هو جوهرة حقيقية على الساحل الجزائري، وجهة ساحلية تستحق الاكتشاف. يقع هذا الشاطئ في إطار طبيعي استثنائي، ويقدم تجربة لا تُنسى للزوار الباحثين عن الاسترخاء والجمال الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1648
            ["id" => "d32fd64e-5a29-4ca4-b17c-55a184a3909f", "translation" => "The Nedjma beach is a charming family beach with ample parking for your convenience. However, it's important to note that there is unfortunately some pollution on the beach, which can slightly diminish the natural setting. We strongly encourage you to take the time to carry your trash with you at the end of your day at the sea to preserve this environment for future visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e8b46fcd-7730-46ff-adc8-0949b91bdfee", "translation" => "La plage Nedjma est une charmante plage familiale qui dispose d'un grand parking pour faciliter votre stationnement. Cependant, il est important de noter qu'il y a malheureusement une certaine pollution sur la plage, ce qui peut légèrement ternir le cadre naturel. Nous vous encourageons vivement à prendre le temps d'emporter vos déchets avec vous à la fin de votre journée à la mer, afin de préserver cet environnement pour les prochains visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "f87eebb9-d394-4a82-a78e-688aba0a1c95", "translation" => "شاطئ نجمة هو شاطئ عائلي ساحر يتوفر على مواقف كبيرة للسيارات لتسهيل ركنها. ومع ذلك، من المهم ملاحظة أن هناك للأسف بعض التلوث على الشاطئ، مما قد يؤثر بشكل طفيف على البيئة الطبيعية. نحن نشجع بشدة على أن تأخذ الوقت لحمل مخلفاتك معك في نهاية يومك على البحر، من أجل الحفاظ على هذا البيئة للزوار القادمين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1649
            ["id" => "8cb33dcf-cadd-4450-8a06-3ecf6da78858", "translation" => "The Terga beach is a beautiful stretch of sand, perfect for family outings. It is surrounded by various shops, providing great convenience for visitors. It is characterized by its wide sandy expanse, offering ample space for many people, and a large parking area is also available for cars.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3b316277-119f-49b5-8f69-485a90a26147", "translation" => "La plage de Terga est une belle étendue de sable, parfaite pour des sorties en famille. Elle est entourée de nombreux commerces, offrant ainsi une grande commodité pour les visiteurs. Elle se caractérise par sa large bande de sable, offrant beaucoup d'espace pour de nombreuses personnes ainsi qu’un grand parking est également disponible pour les voitures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "be84137b-614c-4ba2-ba26-e8a86165ec76", "translation" => "شاطئ تارقة هو ممتد من رمال جميلة، مثالي للرحلات العائلية. يحاط بالعديد من المحلات التجارية، مما يوفر راحة كبيرة للزوار. يتميز بشريط رملي واسع، مما يوفر مساحة كبيرة للعديد من الأشخاص، ويتوفر أيضًا موقف كبير للسيارات.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1650
            ["id" => "39f2fa55-0e66-46ed-a135-004044ebbfa3", "translation" => "The El Ain beach is undeniably beautiful but comes with some danger due to its isolation and lack of protections. Moreover, access to this beach can be challenging because of road conditions. Despite these challenges, it offers a splendid natural setting for those willing to overcome them to enjoy its beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "527c1f6c-7298-438e-b9ba-c54dcbb8b5f2", "translation" => "La plage d'el Ain est indéniablement magnifique, mais elle présente un certain danger en raison de son isolement et de l'absence de protections. De plus, l'accès à cette plage peut être difficile en raison des conditions de la route. Malgré ces défis, elle offre un cadre naturel splendide pour ceux qui sont prêts à relever ces défis pour profiter de sa beauté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c6a5d276-643d-46f9-b07a-35862c220b47", "translation" => "شاطئ العين جميل بلا شك، ولكنه يحمل بعض الأخطار بسبب عزله وعدم وجود حماية. علاوة على ذلك، الوصول إلى هذا الشاطئ يمكن أن يكون تحديًا بسبب حالة الطريق. على الرغم من هذه التحديات، إلا أنه يقدم إعدادًا طبيعيًا رائعًا لأولئك الذين على استعداد للتغلب على هذه التحديات للاستمتاع بجماله.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1651
            ["id" => "5538e5d9-88fa-4ae0-bf82-7bd2fa0b60a6", "translation" => "The El Hilal beach invites you to experience exceptional moments with your family, create unforgettable memories, and relax in a magical setting. Discover it for a unique beach experience where the sun, sand, and sea come together to create a dreamlike place.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6af9bde1-963e-42a2-9a4b-37e897d4be24", "translation" => "La plage d’el Hilal vous invite à vivre des moments exceptionnels en famille, à créer des souvenirs inoubliables et à vous détendre dans un cadre magique. Découvrez-la pour une expérience de plage unique, où le soleil, le sable et la mer se conjuguent pour créer un lieu de rêve.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "12e5294b-94c5-45bc-90b0-824eac8c545a", "translation" => "شاطئ الهلال يدعوك لتجربة لحظات استثنائية مع عائلتك، لخلق ذكريات لا تُنسى، وللاسترخاء في إطار ساحر. اكتشفه لتجربة شاطئ فريدة، حيث يتلاقى الشمس والرمال والبحر لخلق مكان أحلام.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1652
            ["id" => "5c891df4-ccf0-447b-8816-19db104e4ef5", "translation" => "The Chatt el Ward beach is a small gem nestled along the coast of Aïn Temouchent. With few beach huts, this beach provides an authentic experience in harmony with nature. The sand, though a bit coarse with large grains, adds a rustic touch to its charm.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3ee96771-5a97-4292-8b6a-01353ef29e98", "translation" => "Plage Chatt El Ward est une petite perle nichée le long de la côte d'Aïn Témouchent. Avec peu de cabanons, cette plage offre une expérience authentique en harmonie avec la nature. Le sable, bien que un peu grossier avec de gros grains, ajoute une touche rustique à son charme.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "020d4bcd-fe83-4d3a-8649-4ae5b177e3ac", "translation" => "شاطئ الورد هو جوهرة صغيرة مدفونة على طول ساحل عين تموشنت. مع وجود عدد قليل من الأكشاك، يوفر هذا الشاطئ تجربة أصيلة في وئام مع الطبيعة. الرمال، على الرغم من أنها قليلًا خشنة مع حبيبات كبيرة، تضيف لمسة ريفية إلى جاذبيته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1653
            ["id" => "e7b69715-8dec-4fe2-8c64-7cfaa58a09bf", "translation" => "The Sidi Djelloul beach is a natural wonder with its fine and unspoiled sand. It's a true treasure in terms of natural beauty. When you arrive at this beach, you will be enchanted by its pristine state.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7dedf4da-aca9-4e27-91be-8bbcab6d6d51", "translation" => "La plage de Sidi Djelloul est une merveille naturelle avec son sable fin et préservé. C'est un véritable trésor en termes de beauté naturelle. Lorsque vous arriverez sur cette plage, vous serez enchanté par son état naturel préservé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "eb189d43-d7a5-4e4b-beb2-24eea8599a46", "translation" => "شاطئ سيدي جلول هو عجب طبيعي برماله الناعمة والمحافظ عليها. إنه كنز حقيقي من حيث الجمال الطبيعي. عندما تصل إلى هذا الشاطئ، ستُسحر بحالته الطبيعية المحفوظة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1654
            ["id" => "76c2dd75-e321-40e9-9e4e-04bb56673197", "translation" => "While access may be a bit challenging, the journey is truly worth it to enjoy this beautiful and secluded beach. It's an ideal place to escape the hustle and bustle of everyday life and recharge in the midst of pristine nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "48c8f7d6-5620-4c40-8169-ce2c0661b135", "translation" => "Bien que l'accès puisse être un peu difficile, le voyage en vaut vraiment la peine pour profiter de cette plage magnifique et isolée. C'est un endroit idéal pour échapper à l'agitation de la vie quotidienne et se ressourcer au milieu d'une nature préservée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fad0e9d4-1f6d-4a62-b97f-ec89005c5aad", "translation" => "على الرغم من أن الوصول قد يكون صعبًا بعض الشيء، إلا أن الرحلة تستحق حقًا للاستمتاع بشاطئ هذا الجمال الخلّاب والمنعزل. إنه مكان مثالي للهروب من صخب الحياة اليومية والاستعادة في وسط طبيعة محافظة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1655
            ["id" => "c092e77c-3563-4c83-9e71-46c6736dde6f", "translation" => "The Sidi Boucif beach is a very beautiful place, especially outside the summer season. It's a family beach, and though it's small in size, it offers a peaceful setting for relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "09c9fcbb-b6c7-477c-bfe0-5dd8b6b27a8c", "translation" => "La plage de Sidi Boucif est un très bel endroit, surtout en dehors de la saison estivale. C'est une plage familiale, bien que sa superficie soit petite, elle offre un cadre paisible pour se détendre.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d5d15c77-cdf0-42e6-91b6-108ccedd73d7", "translation" => "شاطئ سيدي بوسيف هو مكان جميل جدًا، خصوصًا خارج موسم الصيف. إنه شاطئ عائلي، وعلى الرغم من صغر مساحته، إلا أنه يقدم إطارًا هادئًا للاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1656
            ["id" => "0724663c-5000-44d5-a782-c54b422e0374", "translation" => "The Beni Saf fishing port is a bustling place where you can observe the frenetic activity of the fishermen, discover freshly caught seafood products, and perhaps even savor local seafood in nearby restaurants.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "426a382d-ef20-496a-a088-fb07aacc0037", "translation" => "Le port de pêche de Beni Saf est un endroit animé, où vous pouvez observer l'activité frénétique des pêcheurs, découvrir les produits de la mer fraîchement pêchés, et peut-être même déguster des fruits de mer locaux dans les restaurants avoisinants.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b7591f5e-9cef-4b77-8444-8f8b898c2227", "translation" => "ميناء صيد بني صاف هو مكان حيوي، حيث يمكنك مشاهدة النشاط المزدحم للصيادين، اكتشاف منتجات البحر الطازجة، وربما حتى تذوق المأكولات البحرية المحلية في المطاعم المجاورة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1657
            ["id" => "3e545688-0b71-41c2-abb8-5cd4a5f96f1f", "translation" => "If you're looking for a place with breathtaking views, easy access from the city, and a unique atmosphere, the well beach can always be an interesting destination.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0fc582f5-ae6b-4763-9afb-c5c6a736f9b6", "translation" => "Si vous recherchez un lieu avec une vue imprenable, un accès facile depuis la ville et une atmosphère particulière, la plage du puit peut toujours être une destination intéressante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "cef2e91b-3fba-4286-9026-140866ec18a1", "translation" => "إذا كنت تبحث عن مكان يتمتع بإطلالات رائعة، وسهولة الوصول من المدينة، وأجواء فريدة، فإن شاطئ البئر يمكن أن يكون دائمًا وجهة مثيرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1658
            ["id" => "488cf3e4-bda2-428f-bf6f-d0386d975def", "translation" => "The annex of Beni Saf currently has 20 cosmopolitan aquariums where various fish species coexist. It is possible to double the number of tanks to showcase a greater variety of aquatic animals within this unique research facility in the western region of the country.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "bce1f2fe-0c1b-44aa-8e69-c5006a1e7bae", "translation" => "L'annexe de Beni Saf dispose actuellement de 20 aquariums cosmopolites où cohabitent diverses espèces de poissons. Il est envisageable de doubler le nombre de bassins pour présenter une plus grande variété d'animaux aquatiques au sein de cette structure de recherche unique dans la région ouest du pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "54450ac1-5711-4ba8-8564-5bcf1bcc8572", "translation" => "فرع بني صاف حالياً يحتوي على 20 حوضًا زجاجيًا كبيرًا يتشارك فيها أنواع مختلفة من الأسماك. من الممكن مضاعفة عدد الأحواض لعرض مجموعة أوسع من الكائنات المائية داخل هذه المنشأة البحثية الفريدة في منطقة الغرب من البلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1659
            ["id" => "8bcf2683-6eb1-45e9-8427-1d3ea85e8d83", "translation" => "The Khouidem cove is a hidden treasure, a true gem of nature where paradise meets the Earth. This cove offers a landscape of unparalleled beauty with its crystal-clear waters. It's the perfect place for a quiet and peaceful getaway away from the hustle and bustle of daily life. However, it's important to note that access to this cove can be a bit challenging, making it a preserved spot from the tourist crowds.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "390b4de8-9a7d-4a82-8a32-28a32a1bc277", "translation" => "La crique Khouidem est un trésor caché, une véritable pépite de la nature où le paradis s'ouvre sur la Terre. Cette crique offre un paysage d'une beauté inégalée avec ses eaux cristallines. C'est l'endroit parfait pour une escapade tranquille et paisible loin de l'agitation de la vie quotidienne. Cependant, il est important de noter que l'accès à cette crique peut être un peu difficile, ce qui en fait un lieu préservé de la foule touristique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "30b9ed9e-de5e-4a1f-9630-e36d1b4ae981", "translation" => "خليج خويدم هو كنز مخفي، جوهرة حقيقية من الطبيعة. يوفر هذا الخليج مناظر طبيعية لا مثيل لها مع مياهه الصافية. إنه المكان المثالي للهروب الهادئ والسلمي بعيدًا عن صخب الحياة اليومية. ومع ذلك، من المهم ملاحظة أن الوصول إلى هذا الخليج يمكن أن يكون قليلاً صعبًا، مما يجعله موقعًا محفوظًا من حشود السياح.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1660
            ["id" => "2e584745-0247-4172-909a-e495c045ec74", "translation" => "The Bakhaboro beach is a true natural wonder. With its fine sand and clear waters, it is one of the most beautiful beaches on the coast. However, it is important to note that this beach needs attention as it lacks facilities and the presence of civil protection. Nevertheless, if you're looking for a breathtaking beach and a pure connection with nature, the Bakhaboro beach is the perfect place to visit.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "02c885d1-1a5d-4dc6-baa3-949bef78d4b0", "translation" => "La plage Bakhaboro est une véritable merveille naturelle. Avec son sable fin et ses eaux claires, elle est l'une des plus belles plages de la côte. Cependant, il est important de noter que cette plage a besoin d'attention, car elle manque d'installations et de la présence de la protection civile. Malgré cela, si vous recherchez une plage à couper le souffle et un contact pur avec la nature, la plage Bakhaboro est l'endroit idéal à visiter.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6ea58b2e-950c-448c-bea5-ef3737e3e349", "translation" => "شاطئ باخابورو هو عجب طبيعي حقيقي. برماله الناعمة ومياهه الصافية، إنه واحد من أجمل الشواطئ على الساحل. ومع ذلك، من المهم أن نلاحظ أن هذا الشاطئ يحتاج إلى العناية حيث يفتقر إلى المرافق ووجود الحماية المدنية. ومع ذلك، إذا كنت تبحث عن شاطئ رائع واتصال نقي مع الطبيعة، فإن شاطئ باخابورو هو المكان المثالي للزيارة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1661
            ["id" => "22315c07-e39a-480d-a403-26b947c83bdf", "translation" => "The Ennabil beach is a beautiful stretch of sand where you can enjoy the sun and the sea. With its clear water and peaceful atmosphere, it's the perfect place to relax with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e54597a8-d00e-463e-ae45-6f2aedaa5a6c", "translation" => "La plage Ennabil est une magnifique étendue de sable où vous pourrez profiter du soleil et de la mer. Avec son eau claire et son ambiance paisible, c'est l'endroit idéal pour se détendre en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "89b5a33c-f90f-4c4e-b4c4-0b6868c2061c", "translation" => "شاطئ النبيل هو ممتد رملي رائع حيث يمكنك الاستمتاع بالشمس والبحر. بمياهه الصافية وأجوائه الهادئة، إنه المكان المثالي للاسترخاء مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1662
            ["id" => "e20ecde9-51b2-487f-bea8-75e577cef5fc", "translation" => "The Madrid beach is a small and popular family beach. However, due to its small size, it can get quite crowded, which can be a downside. Nonetheless, the beach remains a lovely spot for families, with safety measures in place, and you have the opportunity to visit the Leila and Rachgoun Islands from this beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9f756ef2-c993-4a96-ae7d-8c839779363b", "translation" => "La plage Madrid est une petite plage très fréquentée, idéale pour les familles. Cependant, en raison de sa petite taille, elle peut devenir très encombrée, ce qui peut être un inconvénient. Malgré cela, la plage reste un bel endroit pour les familles, avec des mesures de sécurité en place, et vous avez la possibilité de visiter les îles Leila et Rachgoun depuis cette plage.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "30a52853-431a-4ffe-99e7-91ce673ed1f6", "translation" => "شاطئ مدريد هو شاطئ صغير ومشهور يعتبر مثاليًا للعائلات. ومع ذلك، بسبب صغر حجمه، يمكن أن يزدحم بشدة، مما يمكن أن يكون عيبًا. على الرغم من ذلك، يظل الشاطئ مكانًا جميلًا للعائلات، مع تدابير السلامة المعتمدة، ولديك الفرصة لزيارة جزيرتي ليلى ورشقون من هذا الشاطئ.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1663
            ["id" => "7befdb0b-50c1-47cc-9cf6-600fbb20e94f", "translation" => "The East Rachgoun beach is a family-friendly and clean beach, offering a beautiful view of the sea with a clear horizon. It is considered one of the best beaches in the far west of the country.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5dd5bcc4-9115-4d58-99cb-82b7dbf853ed", "translation" => "La plage de Rachgoun Est est une plage familiale et propre, offrant une belle vue sur la mer, avec un horizon dégagé. Elle est considérée comme l'une des meilleures plages de l'extrême ouest du pays.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "31057c04-d5f5-4fef-bf33-e96f6d313e01", "translation" => "شاطئ رشقون الشرقي هو شاطئ عائلي نظيف، يوفر إطلالة جميلة على البحر مع أفق واضح. يُعتبر واحدًا من أفضل الشواطئ في أقصى غرب البلاد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1664
            ["id" => "8cddc8e0-134a-441f-8099-e7e9d92aac58", "translation" => "The Rachgoun Aquapark is a good water park offering unique water games. Their service is of quality, and the facility is well-maintained, ensuring a pleasant experience.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "244e99c8-a18b-4891-afc9-c2011d82ad7c", "translation" => "Le Rachgoun Aquapark est un bon parc aquatique proposant des jeux aquatiques uniques. Leur service est de qualité, et l'établissement est bien entretenu, garantissant une expérience agréable.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "4577b6ab-dc90-4aa2-af79-960b9370bec2", "translation" => "حديقة رشقون المائية هي حديقة جيدة تقدم ألعاب مائية فريدة. خدمتهم عالية الجودة، والمنشأة مُعتنى بها بشكل جيد، مما يضمن تجربة ممتعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1665
            ["id" => "c812873b-121f-42ea-943c-184d7db03a64", "translation" => "The Allou Fun Park is an amusement park offering a variety of activities specially designed for children. This place is synonymous with entertainment and joy for the little ones, with exciting rides, fun games, and an unforgettable experience for families seeking fun.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "97efbf14-3a37-43b9-9157-4f1c227e3c27", "translation" => "Le Allou Fun Park est un parc d'attractions offrant une variété d'activités spécialement conçues pour les enfants. Cet endroit est synonyme de divertissement et de joie pour les plus jeunes, avec des manèges passionnants, des jeux amusants, et une expérience inoubliable pour les familles en quête de fun.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a7100dc1-51f5-4a66-a366-117b9a53d893", "translation" => "ألو بارك هو منتزه ترفيهي يقدم مجموعة متنوعة من الأنشطة مصممة خصيصًا للأطفال. هذا المكان هو مرادف للترفيه والفرح للأطفال الصغار، مع ألعاب مثيرة وألعاب ممتعة، وتجربة لا تُنسى للعائلات الباحثة عن المرح.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1666
            ["id" => "9809cb51-2e05-4667-bef5-f3f271e427c2", "translation" => "The Zouanif beach is a wild stretch of sand nestled at the base of a cliff and accessible after a walk of about 2 km. This beach offers a pristine and untouched natural setting, far from any tourist development. The place is of exceptional beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e7c867a8-2182-48aa-a2fc-b8ef449b55d4", "translation" => "La plage de Zouanif est une étendue sauvage de sable, nichée au pied d'une falaise et accessible après une marche d'environ 2 km. Cette plage offre un cadre naturel préservé et vierge, éloigné de toute installation touristique. L'endroit est d'une beauté exceptionnelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "44255d49-68da-44f5-b869-191bd3d25653", "translation" => "شاطئ زوانيف هو ممتد بري طبيعي من الرمال، يتدثر في قاعدة منحدر ويمكن الوصول إليه بعد مسيرة قدرها حوالي 2 كيلومتر. يقدم هذا الشاطئ إعداداً طبيعياً نقياً ومحتفظاً بطبيعته، بعيداً عن أي تطوير سياحي. المكان يتمتع بجمال استثنائي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1667
            ["id" => "506b9490-cad0-4b4f-8d68-21b71914d1be", "translation" => "The Malous beach is a vast stretch of sand and pebbles that extends for over a kilometer. It's a peaceful, family-friendly place, perfect for relaxing and enjoying the natural beauty of the area.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2d38aea5-9d06-402a-b0b4-f3a695b21f8d", "translation" => "La plage de Malous est une vaste étendue de sable et de galets qui s'étend sur plus d'un kilomètre. C'est un endroit paisible et familial, idéal pour se détendre et profiter de la beauté naturelle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "be417f6f-217b-4789-bdd4-7952ac5e0793", "translation" => "شاطئ مالوس هو مساحة واسعة من الرمال والحصى تمتد لأكثر من كيلومتر واحد. إنه مكان هادئ ومناسب للعائلات، مثالي للاسترخاء والاستمتاع بجمال الطبيعة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1668
            ["id" => "cfda00c1-b69d-46e9-8137-90a74faa6010", "translation" => "The Sidi Yaakoub beach is a hidden gem. While its access may be a bit challenging with a walk of about 30 minutes, it's well worth it. It's the perfect place for camping enthusiasts and those looking for an unspoiled beach. Its stunning landscapes and panoramic views make it one of the most beautiful pristine beaches you can find, promising unforgettable days in the great outdoors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b354c898-96e1-4c73-a0f4-7ddc8a48bddf", "translation" => "La plage de Sidi Yaakoub est un véritable trésor caché. Bien que son accès puisse être un peu difficile avec un temps de marche d'environ 30, elle en vaut vraiment la peine. C'est l'endroit idéal pour les amateurs de camping et ceux qui recherchent une plage préservée. Ses paysages magnifiques et ses vues panoramiques en font l'une des plus belles plages vierges que vous puissiez trouver, et elle promet des journées inoubliables en pleine nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2c916995-4cff-4e00-8978-829a88fc50ab", "translation" => "شاطئ سيدي يعقوب هو كنز مخفي. بالرغم من أن الوصول إليه قد يكون صعبًا قليلاً مع مسيرة تستغرق حوالي 30 دقيقة، إلا أنه يستحق بالفعل ذلك. إنه المكان المثالي لعشاق التخييم وأولئك الذين يبحثون عن شاطئ غير متأثر. مناظره الخلابة ومناظره البانورامية تجعله واحدًا من أجمل الشواطئ النقية التي يمكنك العثور عليها، ويعد بأيام لا تُنسى في الطبيعة البرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1669
            ["id" => "0442b15e-f16a-4b53-b355-bea4c314bd93", "translation" => "The Ouardania beach is perfect for relaxing moments with friends or family. With its superb waters, it offers a great opportunity for diving, making this beach an ideal choice for adventure seekers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "da76d7ef-6e5c-4b8c-94c3-7c4545b64df4", "translation" => "La plage Ouardania est parfaite pour des moments de détente en compagnie d'amis ou de la famille. Avec ses eaux superbes, elle offre une véritable opportunité pour la plongée, faisant de cette plage un choix idéal pour les gens en quête d'aventure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "14aa419a-4047-44b5-a837-368e34632798", "translation" => "شاطئ وردانية مثالي للأوقات المسترخية مع الأصدقاء أو العائلة. بفضل مياهه الرائعة، يوفر هذا الشاطئ فرصة كبيرة للغوص، مما يجعله اختيارًا مثاليًا للباحثين عن المغامرة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1670
            ["id" => "89d560c6-bfb5-4764-af16-5d1a5bd10fd0", "translation" => "The Benitalha Land Park is an ideal place for families, where you'll discover a family-friendly environment. You can find a variety of refreshments, ice cream, desert tea, and treats for the kids. Additionally, you have the option to bring your own food and have a picnic on-site.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b7b24337-a539-4c71-b0ea-1f26390b5cbd", "translation" => "Le Benitalha Land Park est un lieu idéal pour les familles, où vous découvrirez un environnement respectueux. Vous y trouverez une variété de rafraîchissements, des glaces, du thé du désert et des douceurs pour les enfants. De plus, vous avez la possibilité d'apporter votre propre nourriture et de dîner sur place.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7f324c2d-fbcc-4c19-8b1f-cd35c6c868d0", "translation" => "بني طلحة لاند بارك مكان مثالي للعائلات، حيث ستجد بيئة صديقة للأسرة. يمكنك العثور على مجموعة متنوعة من المشروبات المنعشة، والآيس كريم، وشاي الصحراء، والحلويات للأطفال. بالإضافة إلى ذلك، لديك الخيار لإحضار طعامك الخاص وتناول وجبتك هناك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1671
            ["id" => "80f9f917-16dd-4c9c-b17e-54ad2d9da7b3", "translation" => "This public garden is a green oasis in the heart of the city. It's a place where residents and visitors can relax, take a stroll, and enjoy nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "84d1e905-c4f0-4718-b80c-ea7580d656bf", "translation" => "Ce jardin public est un havre de verdure en plein cœur de la ville. C'est un endroit où les habitants et les visiteurs peuvent se détendre, se promener et profiter de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "59231424-dc29-4800-83cb-e1285b135e74", "translation" => "هذه الحديقة العامة هي واحة خضراء في قلب المدينة. إنها مكان يمكن للسكان والزوار الاسترخاء فيه، والتجول، والاستمتاع بالطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1672
            ["id" => "f65d38c1-581e-492e-bc61-63f403587619", "translation" => "The former Saint-Laurent church, now converted into a mosque, preserves much of its original architecture, making it a unique place where the old and the new come together.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "01131399-0d38-4d00-bdc9-88fa879588a1", "translation" => "L'ancienne église Saint-Laurent, désormais transformée en mosquée, conserve une grande partie de son architecture originale, ce qui en fait un lieu unique où l'ancien et le nouveau se rencontrent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ab374c48-8482-4352-8414-077977bb0894", "translation" => "الكنيسة القديمة سانت لوران، والتي تم تحويلها الآن إلى مسجد، تحتفظ بالعديد من عناصر هندستها الأصلية، مما يجعلها مكانًا فريدًا حيث يلتقي الماضي والحاضر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1673
            ["id" => "a4fa48c1-ec1a-4a5f-96a1-08fe2644a1fd", "translation" => "This small amusement park is a great place to have joyful family moments. It offers a variety of attractions designed especially for children, ensuring smiles and laughter throughout the day.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a984ea73-06ed-48fd-88c0-037cd10ec316", "translation" => "Ce petit parc d'attractions est un endroit idéal pour passer des moments joyeux en famille. Il propose une variété d'attractions spécialement conçues pour les enfants, garantissant ainsi des sourires et des rires tout au long de la journée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "88992f6f-b52a-48a9-aca3-182495216f59", "translation" => "هذا المنتزه الصغير للألعاب الترفيهية مكان مثالي لقضاء أوقات سعيدة مع العائلة. إنه يقدم مجموعة متنوعة من الألعاب مصممة خصيصًا للأطفال، مما يضمن الابتسامات والضحك طوال اليوم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1674
            ["id" => "abd46f36-0146-4c77-baf6-60ccf77286f5", "translation" => "The Archaeological museum of Ain Temouchent is a must-visit place for history and culture enthusiasts, providing an educational and enriching experience for all who visit.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cd68f9df-94bf-47fc-99fe-59fa45e4c922", "translation" => "Le musée archéologique d'Aïn Témouchent est un lieu incontournable pour les amoureux de l'histoire et de la culture, offrant une expérience éducative et enrichissante pour tous ceux qui le visitent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a870147b-365b-4bb5-8041-303d5129d9a3", "translation" => "متحف عين تموشنت الأثري هو مكان يجب زيارته لعشاق التاريخ والثقافة، حيث يقدم تجربة تعليمية ومثرية لكل من يزوره.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1675
            ["id" => "ea41b19f-b999-4484-88ef-3289211ffd02", "translation" => "This garden is a true haven of peace in the heart of the local community. Nestled in a picturesque setting, this garden provides an outdoor relaxation space for residents and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "203e0e9e-bd59-4936-a3f1-9382bde058c4", "translation" => "Ce jardin est un véritable havre de paix au cœur de la communauté locale. Niché dans un cadre pittoresque, ce jardin offre un espace de détente en plein air pour les résidents et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "345d5337-92c9-4563-bcda-7d443a97dc89", "translation" => "هذه الحديقة هي ملاذ حقيقي للسلام في قلب المجتمع المحلي. ملتحفًة في إطار جميل، توفر هذه الحديقة مساحة للاسترخاء في الهواء الطلق للمقيمين والزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1676
            ["id" => "390e3eee-ac00-47f7-b24e-fa5c9f1bc9e9", "translation" => "The Ain el Arbaa square is a charming public space located in the heart of the city. It is a popular meeting and relaxation spot for residents and visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "9e6e0e25-b221-4dd8-a461-91cafd59592e", "translation" => "La Placette Ain El Arbaa est un charmant espace public situé au cœur de la ville. C'est un lieu de rencontre et de détente apprécié par les habitants et les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ba69d39c-8aca-4d14-acf5-ccd86b6ece7d", "translation" => "ساحة عين الأربعاء هي ساحة عامة ساحرة تقع في قلب المدينة. إنها مكان للقاء والاسترخاء يُقدر عليه سكان المدينة والزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1677
            ["id" => "d0ce98f5-4709-4ffd-a075-a8f256e96417", "translation" => "Surrounded by lush greenery and majestic trees, the garden creates a peaceful and refreshing atmosphere. The winding paths invite you to take a leisurely stroll, admire the colorful flower beds, and enjoy the welcome shade of the trees.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "33db1dc7-d18f-48a4-9f35-732c3852db3f", "translation" => "Entouré de verdure luxuriante et d'arbres majestueux, le jardin crée une atmosphère paisible et rafraîchissante. Les sentiers sinueux vous invitent à vous promener tranquillement, à admirer les parterres de fleurs colorées et à profiter de l'ombre bienvenue des arbres.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d006f95a-d7be-49d1-bc7f-e4d900696b28", "translation" => "محاطًا بالخضرة النابضة بالحياة والأشجار الرفيعة، تخلق الحديقة جوًا هادئًا ومنعشًا. الطرق المتعرجة تدعوك للتجول ببطء، والتمتع بمشاهدة أسرّة الزهور الملونة والاستفادة من الظل المرحب المقدم من الأشجار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1678
            ["id" => "92b3a3fc-c35b-4718-9d4f-c1095444f47e", "translation" => "The statue is a representation of this legendary corsair, standing on a pedestal and wielding a sword, symbolizing his bravery and his status as an important historical figure in the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3f10848e-820c-4f23-8d3d-8ee9e35ce723", "translation" => "La statue est une représentation de ce corsaire légendaire, debout sur un socle et brandissant une épée, symbolisant sa bravoure et son statut en tant que personnage historique important de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "832bea02-5626-4288-b334-da00d2487a9e", "translation" => "التمثال هو تمثيل لهذا القرصان الأسطوري، واقفًا على قاعدة ومرتديًا سيفًا، رمزًا لشجاعته ومكانته كشخصية تاريخية مهمة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1679
            ["id" => "db6c405f-b940-4902-baa5-a96eb8d02ec2", "translation" => "This public garden is a peaceful green space located in the heart of this charming town. It provides residents and visitors with a pleasant place to relax and rejuvenate.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c32a033e-bb92-4c3f-84ba-87308cbeac59", "translation" => "Ce jardin public est un espace de verdure paisible situé au cœur de cette charmante localité. Il offre aux habitants et aux visiteurs un endroit agréable pour se détendre et se ressourcer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a5897305-81c9-48cf-81d1-2b89e6ba5938", "translation" => "هذه الحديقة العامة هي مساحة خضراء سلمية تقع في قلب هذه البلدة الساحرة. إنها توفر للسكان والزوار مكانًا ممتعًا للاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1680
            ["id" => "1f523ebe-897b-4552-b9d0-3cf34ff1a486", "translation" => "Whether it's for a leisurely stroll, a relaxing break, or a family day out, this garden is a lush gem that the town of el Amria proudly boasts.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7a09dfec-3b97-4ad9-846c-79aaefd9b047", "translation" => "Que ce soit pour une balade relaxante, une pause détente ou une journée en famille, ce jardin est un joyau verdoyant qui fait la fierté de la ville d’el Amria.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "64576ad8-1069-4789-b802-1385bb6db724", "translation" => "سواء كان الأمر يتعلق بالتجول برحابة، أو أخذ استراحة مريحة، أو قضاء يوم مع العائلة، فإن هذه الحديقة جوهر أخضر تفتخر به مدينة العامرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1681
            ["id" => "485146c0-fdc0-48c5-9f66-7963fbcf70b5", "translation" => "This statue not only embodies Algeria's history, but it also inspires a sense of pride and respect for the Emir Abdelkader and his role in the quest for independence.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2dbd444b-5927-4ddc-8e80-e33f75d26525", "translation" => "Cette statue incarne non seulement l'histoire de l'Algérie, mais elle inspire également un sentiment de fierté et de respect pour l'émir Abdelkader et son rôle dans la quête de l'indépendance.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0e8ea4bf-9944-40fb-b639-3539290f6284", "translation" => "هذه التمثال لا يمثل تاريخ الجزائر فحسب، بل يلهم أيضًا شعورًا بالفخر والاحترام نحو الأمير عبد القادر ودوره في السعي نحو الاستقلال.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1682
            ["id" => "e466aa4c-8946-443f-9a75-73ebb3d975fe", "translation" => "Whether you want to recharge in nature, meditate to the sound of flowing water, or simply marvel at the beauty of this waterfall, the Little Vichy garden is an ideal place to escape the stress of urban life and connect with nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d3deb54d-67b7-4bc3-a2d9-fbb2bafcbdcc", "translation" => "Que vous souhaitiez vous ressourcer en pleine nature, méditer au son de l'eau qui coule, ou simplement vous émerveiller devant la beauté de cette cascade, le jardin du Petit Vichy est un endroit idéal pour échapper au stress de la vie urbaine et vous connecter à la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d5d45b4d-34ac-42d7-8c61-7086b2e28631", "translation" => "سواء كنت ترغب في الاسترخاء في الطبيعة أو التأمل صوت جاري المياه، أو ببساطة في التعجب من جمال هذا الشلال، فإن حديقة فيشي الصغير هي مكان مثالي للهروب من ضغوط الحياة الحضرية والاتصال بالطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1683
            ["id" => "238ae86d-bf2d-46eb-af27-93f19759e0d6", "translation" => "This garden features beautiful flower beds and well-maintained shrubs that add a touch of color and freshness to the surroundings. Paved pathways wind through the garden, inviting visitors to take a stroll while appreciating the beauty of the nature that surrounds them.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cdb7da41-a867-40ed-9278-c5f8871e14fa", "translation" => "Ce jardin est doté de magnifiques parterres de fleurs et d'arbustes bien entretenus, qui ajoutent une touche de couleur et de fraîcheur à l'environnement. Les sentiers pavés serpentent à travers le jardin, invitant les promeneurs à se promener tout en appréciant la beauté de la nature qui les entoure.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3790a313-1bb1-482a-92cc-de6d01220c2d", "translation" => "هذه الحديقة مزينة بحدائق زهور رائعة وشجيرات معتنى بها بشكل جيد، تضيف لمسة من الألوان والانتعاش للمحيط. الأرصفة الممهدة تمتد عبر الحديقة، مدعوةً الزوار للتجول والاستمتاع بجمال الطبيعة المحيطة بهم.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1684
            ["id" => "c96bf7a1-fd23-4854-aa82-4a34a2ff6b00", "translation" => "The Hamza Ibn Abd Elmoutalib mosque is a powerful example of the historical evolution of Hammam Bouhdjer, seamlessly blending its colonial past with its current identity as a center of Muslim worship. It is a place worth visiting for its history and significance in the life of the city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c5034a12-4ae2-49ac-ad6a-349816e5182f", "translation" => "La Mosquée Hamza Ibn Abd Elmoutalib est un exemple puissant de l'évolution historique de Hammam Bouhdjer, mêlant harmonieusement son passé colonial à son identité actuelle en tant que centre de culte musulman. C'est un lieu qui mérite d'être visité pour son histoire et sa signification dans la vie de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0628f306-c781-4af5-8379-418e2fbb34ae", "translation" => "مسجد حمزة بن عبد المطلب هو مثال قوي على التطور التاريخي لحمام بوحجر، حيث يمزج بسلاسة بين ماضيه الاستعماري وهويته الحالية كمركز عبادة للمسلمين. إنه مكان يستحق الزيارة لتاريخه وأهميته في حياة المدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1685
            ["id" => "9b2ed056-b2de-4531-ad3a-3dca240d42bd", "translation" => "Located in the heart of the city, the town hall proudly stands with its imposing appearance, reminiscent of the colonial era that left its mark on this region. The architecture of this building often blends European and local styles, making it a unique example of architectural art from that bygone era.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5d3eb891-e6a3-4088-b751-6302f9d39cb7", "translation" => "Située au cœur de la ville, la mairie se dresse fièrement avec son allure imposante, rappelant l'ère coloniale qui a marqué cette région. L'architecture de ce bâtiment est souvent un mélange de styles européens et locaux, ce qui en fait un exemple unique de l'art architectural de cette époque révolue.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6cb30f61-368f-4024-9203-ffb45e842174", "translation" => "تقع في قلب المدينة، تتوج البلدية بمظهرها المهيمن، مستحضرة العصور الاستعمارية التي سجلت أثرها في هذه المنطقة. عادةً ما تمزج العمارة في هذا المبنى بين الأسلوبين الأوروبي والمحلي، مما يجعلها مثالًا فريدًا من فن العمارة في تلك الحقبة المضت.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1686
            ["id" => "152f3229-b55c-4c9c-96ef-21c05705369e", "translation" => "This memorial is a place of remembrance, where one can pay tribute to the heroes who fought for the country's independence. It symbolizes the importance of preserving the collective memory and passing on to future generations the courage and determination of those who fought for Algeria.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c62638ca-2791-42d6-8dfc-3aa29be1832f", "translation" => "Ce mémorial est un lieu de recueillement et de souvenir, où l'on peut rendre hommage aux héros qui ont combattu pour l'indépendance du pays. Il symbolise l'importance de préserver la mémoire collective et de transmettre aux générations futures le courage et la détermination de ceux qui se sont battus pour l'Algérie.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c8f50d1c-3514-4041-942b-8bd08ce13092", "translation" => "هذا المقام هو مكان للتأمل والتذكير، حيث يمكن للزوار تقديم العرفان لأبطال قاتلوا من أجل استقلال البلاد. إنه يرمز إلى أهمية الحفاظ على الذاكرة الجماعية ونقل شجاعة وإصرار الذين قاتلوا من أجل الجزائر إلى الأجيال القادمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1687
            ["id" => "ea378392-40d0-4a3d-a3c6-82ceda9c7754", "translation" => "With its characteristic architecture from that era, it evokes a bygone past. Although it is no longer in operation as a church, it remains a part of the region's cultural heritage.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a2403eaf-3a76-4eeb-9a62-aa94574ea55b", "translation" => "Avec son architecture caractéristique de cette époque, elle rappelle un passé révolu. Bien qu'elle ne soit plus en fonction en tant qu'église, elle demeure un élément du patrimoine culturel de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7be1e5f4-0888-489d-aee7-cff298dd6d84", "translation" => "بفضل هندستها المعمارية المميزة في تلك الحقبة، تستحضر الماضي. على الرغم من أنها لم تعد تعمل ككنيسة، إلا أنها تظل جزءًا من التراث الثقافي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1688
            ["id" => "63943d9e-6e3a-459f-8cc8-82470286e826", "translation" => "In addition to its beautiful beach, Agla offers facilities such as showers and toilets for the convenience of visitors. It's a peaceful, safe place that is easily accessible from different parts of the region, making it ideal for enjoying pleasant days by the sea with family or friends.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ce93a348-76d2-41c9-94df-025c927086bb", "translation" => "En plus de sa belle plage, Agla propose des installations telles que des douches et des toilettes pour le confort des visiteurs. C'est un endroit calme, sécurisé et facilement accessible depuis différentes parties de la région, idéal pour passer des journées agréables au bord de la mer en famille ou entre amis.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d650a60c-541f-4d71-9d38-f62c40a6949e", "translation" => "بالإضافة إلى شاطئها الجميل، تقدم آقلة مرافق مثل الدش والمراحيض لراحة الزوار. إنها مكان هادئ وآمن ويمكن الوصول إليه بسهولة من مختلف مناطق الإقليم، مما يجعلها مثالية لقضاء أيام ممتعة على شاطئ البحر مع العائلة أو الأصدقاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1689
            ["id" => "be54b3e6-613b-4e5c-b30f-0c6c0ae24efc", "translation" => "The Agla 2 beach is located just 100 meters east of its twin sister. The sand on this beach is finer and does not contain pebbles, providing a smoother and more comfortable beach experience for visitors. It's a perfect place to soak up the sun and enjoy the sea in a peaceful setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f36a0646-cfb8-4ac8-b7ca-ea66bfcc1759", "translation" => "La plage Agla 2 est située à seulement 100 mètres à l'est de sa sœur jumelle, le sable sur cette plage est plus fin et ne contient pas de galets, offrant ainsi une expérience de plage plus douce et confortable pour les visiteurs. C'est un endroit idéal pour profiter du soleil et de la mer dans un cadre paisible.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "145e2b3b-106c-410d-be53-57fba8ff916d", "translation" => "شاطئ آقلة 2 يقع على بعد مسافة 100 متر فقط شرقاً من نصفه الآخر. الرمال على هذا الشاطئ أرق ولا تحتوي على حصى، مما يوفر تجربة شاطئية أكثر نعومة وراحة للزوار. إنه المكان المثالي للاستمتاع بأشعة الشمس والبحر في بيئة هادئة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1690
            ["id" => "2fb9653e-1176-4c3f-8bda-3a808508003b", "translation" => "The Mkhalled beach is a true haven of wild nature. It is characterized by its complete lack of buildings, electricity, and even a phone network, except for the paved road that takes you to this preserved site. Although not monitored by the authorities, you will feel safe here.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2b492646-1e7d-4f40-a3aa-2afce356a40e", "translation" => "La plage de Mkhalled est un véritable havre de nature sauvage. Elle se caractérise par son absence totale de constructions, d'électricité et même de réseau téléphonique, à l'exception de la route goudronnée qui vous conduit jusqu'à ce site préservé. Bien que non surveillée par les autorités, vous vous sentirez en sécurité ici.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7c203cdb-4e39-43e9-9277-a2c8399b1dcd", "translation" => "شاطئ المخلد هو ملاذ حقيقي للطبيعة البرية. يتميز بعدم وجود أي مبانٍ، وعدم وجود كهرباء أو حتى شبكة هاتفية، باستثناء الطريق المعبد الذي يأخذك إلى هذا الموقع المحفوظ. على الرغم من عدم مراقبته من قبل السلطات، ستشعر بالأمان هنا.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1691
            ["id" => "0e0e53e1-a8fd-4b23-8a4c-fc1dc12f22b9", "translation" => "What makes the Tafsout beach attractive is its immediate proximity to the city, making access to this coastal beauty convenient. A forest of maritime pine trees bordering the beach adds to its visual appeal. However, it's important to note that the establishment of a desalination plant has altered its landscape, raising environmental concerns.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c357261f-ef3d-4041-afa3-2a8519376ef6", "translation" => "Ce qui rend la plage de Tafsout attrayante, c'est sa proximité immédiate de la ville, facilitant l'accès à cette beauté côtière. Une forêt de pins maritimes bordant la plage ajoute à son attrait visuel. Cependant, il est important de noter que l'installation d'une usine de dessalement a altéré son paysage, provoquant des préoccupations environnementales.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2337c2fb-7941-4de3-8473-59a889217e02", "translation" => "ما يجعل شاطئ تافسوت جاذبًا هو قربه الفوري من المدينة، مما يجعل الوصول إلى هذا الجمال الساحلي مريحًا. وجود غابة من أشجار الصنوبر البحرية على حافة الشاطئ يزيد من جاذبيته بصرياً. ومع ذلك، من المهم أن نلاحظ أن إنشاء محطة تحلية المياه قد قلب من منظرها، مما يثير مخاوف بيئية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1692
            ["id" => "e02f2167-90a0-4aa3-ba82-7efb8beb70fa", "translation" => "Whether you are an experienced boater or just looking for a peaceful spot to relax by the water, the Honaine marina provides a charming maritime setting for all visitors.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "82cb418b-370c-4455-8f67-4034c0e39026", "translation" => "Que vous soyez un plaisancier confirmé ou que vous cherchiez un endroit paisible pour vous détendre au bord de l'eau, le port de plaisance de Honaine offre un cadre maritime charmant pour tous les visiteurs.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "be9db244-70f9-4e92-8b3d-bfaa1c279502", "translation" => "سواء كنت ملاّك قارب محترفًا أم كنت مجرد شخص يبحث عن مكان هادئ للاسترخاء على ضفاف الماء، يقدم ميناء هنين بيئة بحرية ساحرة لجميع الزوار.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1693
            ["id" => "19d9ae77-c6e6-49b6-8733-7e417e94c3fe", "translation" => "The Barbadjani beach is a hidden gem nestled between tall cliffs, providing a breathtaking natural setting. It stretches for about five hundred meters, bordered by a large, shaded steep cliff. To the west, you can admire the whiteness of the dome that houses Sidna Noun, adding a unique touch to this site.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d6b2e19e-171f-4f24-9fed-68bdd9b24d35", "translation" => "La plage Barbadjani est une petite merveille nichée entre de hautes falaises, offrant un cadre naturel à couper le souffle. Elle s'étend sur environ cinq cents mètres, bordée d'une grande falaise abrupte à l'ombre. À l'ouest, vous pourrez admirer la blancheur de la coupole qui abrite Sidna Noun, ce qui ajoute une touche unique à ce site.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8701b941-d3e3-48fb-a6dd-7d67b836e29c", "translation" => "شاطئ بربجاني هو جوهرة مخفية موجودة بين جرفين عاليين، ويقدم إطارًا طبيعيًا رائعًا. يمتد لمسافة تقريبية تبلغ حوالي خمسمائة متر، ويحاط بجرف شديد الانحدار ومظلل. إلى الغرب، يمكنكم التعرف على بياض القبة التي تستضيف سيدنا نون، مما يضيف لمسة فريدة لهذا الموقع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1694
            ["id" => "a3138844-fa1f-4f2f-9bdf-268be63c08cc", "translation" => "In addition to its natural beauty, this beach offers convenient services for your comfort. You can rent sunshades, and the presence of the civil defense ensures the safety of everyone. Parking is available, and nearby, you'll find a cafeteria, a pizzeria, and a convenience store to meet your needs.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "057c10cf-f60a-4f12-afa5-7c69a02a9dc5", "translation" => "En plus de sa beauté naturelle, cette plage propose des services pratiques pour votre confort. Vous pouvez louer des parasols, et la présence de la protection civile garantit la sécurité de chacun. Un parking est à votre disposition, et à proximité, vous trouverez une cafétéria, une pizzeria et une supérette pour combler vos besoins.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1bfb1322-cfdc-424a-b096-94c93e5fcfd4", "translation" => "بالإضافة إلى جمالها الطبيعي، يقدم هذا الشاطئ خدمات ملائمة لراحتك. ووجود الدفاع المدني يضمن سلامة الجميع. يتوفر على موقف للسيارات، و بالقرب منه، ستجد مقهى وبيتزيريا وسوبر ماركت لتلبية احتياجاتك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1695
            ["id" => "de17b6e7-332c-4509-b95c-2f3b1a3ef839", "translation" => "This fishing port is a crucial location for fishing activity in the region. It serves as the departure point for numerous fishing boats that head out to sea daily in search of fresh fish. If you're interested in maritime life and fishing, the Dar Yaghmouracene port is a place to visit during your stay in Tlemcen.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6dd1e19d-ebd7-4c8d-88de-6ea11450b5f2", "translation" => "Ce port de pêche est un lieu essentiel pour l'activité de pêche dans la région. Il est le point de départ des nombreuses embarcations de pêche qui partent chaque jour en mer à la recherche de poissons frais. Si vous êtes intéressé par la vie maritime et la pêche, le port de Dar Yaghmouracene est un lieu à visiter lors de votre séjour Tlemcen.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dfdf188c-1900-43d5-8e08-ff09114f32bd", "translation" => "هذا الميناء مكان أساسي لنشاط الصيد في المنطقة. إنه نقطة الانطلاق للعديد من قوارب الصيد التي تغادر البحر يوميا بحثا عن أسماك طازجة. إذا كنت مهتمًا بالحياة البحرية والصيد، فإن ميناء دار يغمراسن هو مكان يجب زيارته خلال إقامتك في تلمسان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1696
            ["id" => "c5be8211-21d9-4a8a-9b00-0ee0e7fa65c7", "translation" => "It's a perfect place to relax in peace, far from the tourist hustle and bustle. Although access may be a challenge, those who choose to explore this beach will be delighted by its pristine natural beauty and peaceful atmosphere. A unique experience for nature and tranquility lovers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f760846c-1b1a-453b-bd61-579ce8402ae2", "translation" => "C'est un endroit idéal pour se détendre en toute tranquillité, loin de l'agitation touristique. Bien que l'accès puisse être un défi, ceux qui choisissent d'explorer cette plage seront enchantés par sa beauté naturelle préservée et son atmosphère paisible. Une expérience unique pour les amoureux de la nature et de la tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "08465af8-2633-4b96-a652-71804ea4c5d6", "translation" => "إنه مكان مثالي للاسترخاء في سلام، بعيدًا عن صخب السياح. على الرغم من أن الوصول إليه قد يكون تحديًا، إلا أن الذين يختارون استكشاف هذا الشاطئ سيكونون مسرورين بجماله الطبيعي النقي وجوه الهادء. تجربة فريدة لعشاق الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1697
            ["id" => "3dac011d-3008-450d-aaa9-de799e1b991c", "translation" => "The Souinia beach is a hidden gem waiting for you, but keep in mind that you'll need to venture on foot to access it. This bay features a sandy beach bordering crystal-clear waters teeming with fish.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "4910ce5e-58f2-474d-a583-660ecc9086b8", "translation" => "La plage Souinia est un véritable trésor caché qui vous attend, mais gardez à l'esprit que vous devrez vous aventurer à pied pour y accéder. Cette baie présente une plage de sable qui borde des eaux cristallines, peuplées de poissons.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6194e681-8142-4060-a5e2-b0cb3d2ef423", "translation" => "شاطئ السوينية هو جوهرة مخبأة تنتظرك، ولكن تذكر أنه ستحتاج إلى المغامرة سيرًا على الأقدام للوصول إليه. يتميز هذا الخليج بشاطئ رملي يحده مياه نقية واضحة مليئة بالأسماك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1698
            ["id" => "7c9e68eb-b813-48fb-a5c3-dd61853c0b9e", "translation" => "The port is lively and colorful, with the regular arrival and departure of fishing boats. You can observe the fishermen at work, unloading their precious catch of freshly caught fish. It's also a great place to enjoy fresh and delicious seafood in the local restaurants that line the port.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1f648d7c-859a-48ed-904e-ddfef22a9edb", "translation" => "Le port est animé et coloré, avec l'arrivée et le départ régulier des bateaux de pêche. Vous pouvez y observer les pêcheurs au travail, déchargeant leur précieuse cargaison de poissons fraîchement capturés. C'est également un excellent endroit pour déguster des fruits de mer frais et délicieux dans les restaurants locaux qui bordent le port.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "923dcced-1ce2-4d58-8fb4-073cd2e9d59e", "translation" => "الميناء حيوي وملون، مع وصول ومغادرة منتظمة لقوارب الصيد. يمكنك مشاهدة الصيادين وهم يعملون، حيث يقومون بتفريغ صيدهم الثمين من الأسماك الطازجة التي تم القبض عليها حديثاً. إنه أيضًا مكان رائع للاستمتاع بالمأكولات البحرية الطازجة واللذيذة في المطاعم المحلية التي تحدها الميناء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1699
            ["id" => "a67f52e4-ef08-4c4c-903c-097557cc46af", "translation" => "The Oued Abdellah beach is a lovely place, ideal for families and fishing enthusiasts. This beach offers a truly relaxing experience among the best in the region. The waters are generally clean, and the beach is well-maintained.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "12740bac-66eb-4465-8baf-af0a1c9c1b4b", "translation" => "La plage d’Oued Abdellah est un endroit charmant, idéal pour les familles et les amateurs de pêche. Cette plage offre une véritable expérience de détente parmi les meilleures de la région. Les eaux y sont généralement propres, et la plage est bien entretenue.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "3ffb5203-4c95-45e6-85c5-1219946d35e8", "translation" => "شاطئ واد عبد الله هو مكان جميل، مثالي للعائلات وعشاق الصيد. يقدم هذا الشاطئ تجربة استرخاء حقيقية تعد واحدة من أفضل التجارب في المنطقة. المياه عادةً نظيفة، والشاطئ معتنى به بشكل جيد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1700
            ["id" => "57bbd793-a7cb-4bbd-a262-836026fdf45f", "translation" => "The Dakhla beach is a hidden gem that offers a unique experience for those willing to venture off the beaten path. Located within a natural basin, surrounded by imposing rock walls, its access can be challenging, but it's truly worth it.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "00386192-980c-4327-b144-45512a0a38e4", "translation" => "La plage Dakhla est une perle cachée qui offre une expérience unique pour ceux qui sont prêts à s'aventurer hors des sentiers battus. Située au creux d'un bassin naturel, encerclé par des parois rocheuses imposantes, son accès peut être difficile, mais cela en vaut vraiment la peine.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dbc6fcd6-2227-4b4b-ba08-4cbdc0d50fce", "translation" => "شاطئ الدخلة جوهرة مخفية يقدم تجربة فريدة لأولئك الذين يرغبون في المغامرة بعيدًا عن الدروب المعهودة. يقع داخل حوض طبيعي، محاط بجدران صخرية مهيبة، وصعوبة الوصول إليه يمكن أن تكون تحديًا، ولكنه يستحق بالفعل ذلك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1701
            ["id" => "e57e99cf-43a3-456e-a10e-fd859b692154", "translation" => "Whether you're seeking a moment of relaxation or a simple break in the great outdoors, the garden of the three Hamdoun brothers welcomes you. Come and enjoy the serenity of this green space in the heart of a bustling city.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e0b271d2-7042-418d-b036-a038ede334f0", "translation" => "Que vous soyez en quête d'un moment de relaxation ou d'une simple pause au grand air, le jardin des trois frères Hamdoun vous ouvre ses portes. Venez profiter de la sérénité de cet espace verdoyant au cœur d’une ville animée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7efbffd1-0806-423d-a277-864532abc692", "translation" => "سواء كنت تبحث عن لحظة استرخاء أو استراحة بسيطة في الهواء الطلق، فإن حديقة الإخوة الثلاثة حمدون ترحب بك. تعال واستمتع بسكينة هذا الفضاء الأخضر في قلب مدينة مزدحمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1702
            ["id" => "98b107e5-de03-4c95-96a9-3708b4682a10", "translation" => "Whether you're passionate about architecture, history, or simply looking to explore a place steeped in history and meaning, the old church of Ghazaouet is a must-visit during your city tour.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "79bcca2e-04bb-4acc-8e93-99caa79d5144", "translation" => "Que vous soyez passionné par l'architecture, l'histoire ou que vous cherchiez simplement à découvrir un lieu chargé d’histoire et de sens, l'ancienne église de Ghazaouet est un endroit à ne pas manquer lors de votre visite de la ville.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "375412df-aeae-47e4-a3e1-536437b5955f", "translation" => "سواء كنت مولعًا بالهندسة المعمارية، أو التاريخ، أو مجرد رغبتك في استكشاف مكان محمل بالتاريخ والمعاني، فإن الكنيسة القديمة في الغزوات هي مكان يجب ألا تفوته أثناء زيارتك للمدينة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1703
            ["id" => "a2d88fef-f1a8-41ac-8b91-0345c02e3dd0", "translation" => "If you are willing to make the effort to reach this secluded beach, you will be rewarded with the serenity of this untouched place, far from the urban hustle and bustle. A beautiful rocky beach awaits you, but keep in mind that the access road is not paved.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "50cb3cc2-721c-44a7-97b4-f5092dfdfeff", "translation" => "Si vous êtes prêt à faire l'effort de rejoindre cette plage isolée, vous serez récompensé par la sérénité de cet endroit préservé, loin de l'agitation urbaine. Une jolie plage rocheuse vous attend, mais gardez à l'esprit que la piste d'accès n'est pas goudronnée.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "acc1c353-c44f-4a17-9e66-63f74199cc23", "translation" => "إذا كنت مستعدًا لبذل الجهد للوصول إلى هذا الشاطئ المنعزل، ستكون مكافأتك هدوء هذا المكان الطبيعي، بعيدًا عن صخب الحياة الحضرية. شاطئ صخري جميل ينتظرك، ولكن تذكر أن طريق الوصول إليه غير معبد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1704
            ["id" => "fc1c486b-e868-4366-a6f8-08128535cc36", "translation" => "The Bkhata beach is a true gem, although its access can be challenging due to a rugged, unpaved path. However, once you reach this extraordinary place, all obstacles seem to fade away. The beauty of the beach is breathtaking.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d08a9368-4b88-4816-b8da-88c9769bfc96", "translation" => "La plage Bkhata est un véritable joyau, bien que son accès puisse être un défi en raison d'un chemin difficile à emprunter qui n'est pas goudronné. Cependant, une fois que vous atteignez cet endroit extraordinaire, tous les obstacles semblent s'effacer. La beauté de la plage est à couper le souffle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "ec4cce3e-6d91-4ac2-bab4-293fb3735397", "translation" => "شاطئ البخاتة هو جوهرة حقيقية، على الرغم من أن وصوله قد يكون تحديًا بسبب الطريق الوعر الذي ليس معبدًا. ومع ذلك، بمجرد وصولك إلى هذا المكان الاستثنائي، يبدو أن جميع العقبات تتلاشى. جمال الشاطئ لا يُصدق.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1705
            ["id" => "7a16bfc2-36e4-49e0-a0cc-03a4b65ed091", "translation" => "If you're visiting the area, take the time to soak in the unique atmosphere of this central place, its history, and its bustling life.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "29424ba6-e65f-4287-af49-f73c21d9fe03", "translation" => "Si vous visitez la région, prenez le temps de vous imprégner de l'atmosphère unique de cette place centrale, de son histoire et de sa vie bouillonnante.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6dfe7cad-89f5-4bef-9497-b675de04e6a6", "translation" => "إذا كنت تزور المنطقة، خذ وقتًا لتستمتع بالأجواء الفريدة لهذا المكان المركزي، تاريخه، وحياته المزدحمة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1706
            ["id" => "7cd02cd1-64cf-4ade-abca-4594f8f6ecc4", "translation" => "The Ouled Benayad beach is a true oasis of tranquility, perfect for those seeking a peaceful place to relax. This beach is especially dedicated to families, providing ample space to enjoy in serenity. You'll find a large parking area, which greatly facilitates access.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "39127ef4-c48f-415b-9abf-9c965800b82d", "translation" => "La plage d’Ouled Benayad est une véritable oasis de tranquillité, idéale pour ceux qui recherchent un lieu paisible pour se détendre. Cette plage est spécialement dédiée aux familles, offrant un vaste espace pour profiter en toute quiétude. Vous y trouverez un grand parking, ce qui facilite grandement l'accès.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "17ec504b-a413-45f3-a0dd-227693979fcb", "translation" => "شاطئ أولاد بن عايد هو واحة حقيقية من السكينة، مثالي لأولئك الذين يبحثون عن مكان هادئ للاسترخاء. هذا الشاطئ مخصص خصيصًا للعائلات، حيث يوفر مساحة وفيرة للاستمتاع بالهدوء. ستجد هنا موقفًا كبيرًا للسيارات، مما يسهل الوصول بشكل كبير.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1707
            ["id" => "02d22fa6-b67b-4d89-94b2-d6d7c2501b61", "translation" => "The Laayayat beach is a little piece of paradise, quiet, clean, and secure, where you can relax in peace while admiring the natural beauty of the coastline.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ef20c0d7-61a6-4b48-b99d-a761fe2578a2", "translation" => "La plage de Laayayat est un petit coin de paradis, peu fréquenté, propre et sécurisé, où vous pourrez vous détendre en toute tranquillité tout en admirant la beauté naturelle de la côte.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2a79b8d2-997b-4a5f-a929-b2de0c9cd87f", "translation" => "شاطئ العيايط هو قطعة صغيرة من الجنة، هادئة ونظيفة وآمنة، حيث يمكنك الاسترخاء بسلام بينما تستمتع بجمال الساحل الطبيعي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1708
            ["id" => "49955f1a-8053-4e55-9350-eb7431435383", "translation" => "The Maarouf beach is a beautiful secluded oasis where you can escape the hustle and bustle of modern life and reconnect with nature. It's the perfect place for a peaceful getaway and a relaxing seaside retreat.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a9fa2255-4a41-4cb0-9f82-c9365fb5b7a9", "translation" => "La plage Maarouf est une belle oasis isolée où vous pourrez échapper au tumulte de la vie moderne et vous reconnecter à la nature. C'est l'endroit idéal pour une escapade tranquille et un moment de détente au bord de la mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "20a13f2d-76ed-4a35-94fd-c9da0cc3c743", "translation" => "شاطئ معروف هو واحة جميلة معزولة حيث يمكنك الابتعاد عن صخب الحياة الحديثة وإعادة الاتصال بالطبيعة. إنه المكان المثالي للهروب والاسترخاء على شاطئ البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1709
            ["id" => "0ff5f139-e4ae-4459-a048-9a4dd85660f9", "translation" => "The Bider beach is a wide expanse of sand and rocks, perfect for a family getaway. It provides a safe and peaceful setting for days of relaxation and swimming, as well as leisurely walks along this extensive and beautiful beach.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d8c42511-d875-4fd5-80ac-5317e51c318b", "translation" => "La plage Bider est une vaste étendue de sable et de rochers, parfaite pour une escapade en famille. Elle offre un cadre sécurisé et paisible pour des journées de détente et de baignade, ainsi que des promenades le long de cette plage étendue et magnifique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "2b30f642-fe33-4f4f-a38e-3ffb2387a20f", "translation" => "شاطئ بيدر هو مساحة واسعة من الرمال والصخور، مثالي لقضاء عطلة عائلية. إنه يوفر بيئة آمنة وهادئة لأيام من الاسترخاء والسباحة، بالإضافة إلى النزهات الهادئة على طول هذا الشاطئ الواسع والجميل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1710
            ["id" => "75031982-2c6e-41a6-8390-e3077edb0121", "translation" => "The El Bayda beach is a wild treasure nestled at the end of the municipality. It is completely isolated, except for a long track that leads you to this paradise-like landscape. However, it's important to note that this beach is unguarded, and swimming is prohibited.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "076f6e98-9d12-417b-b0c6-8becc6deb50f", "translation" => "La plage d’el Bayda est un trésor sauvage niché au bout de la commune. Elle est complètement isolée, à l'exception d'une longue piste qui vous conduit vers ce paysage paradisiaque. Cependant, il est important de noter que cette plage n'est pas surveillée, et la baignade y est interdite.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7d044ad2-c9a9-44dd-a082-5e9c94a251c7", "translation" => "شاطئ البياضة هو كنز بري مختبئ في نهاية البلدية. إنه معزول تمامًا، باستثناء مسار طويل يقودك إلى هذا المشهد الجنة. ومع ذلك، من المهم أن نلاحظ أن هذا الشاطئ غير محروس، والسباحة ممنوعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1711
            ["id" => "d3e97cd4-c982-4f66-b5b5-fc0f8dec4775", "translation" => "The Ain Adjroud beach is a natural treasure located along a rugged road, primarily accessible by 4x4 vehicles. This beach stands out with its pebbles and rocks, making it a wild and unspoiled, unguarded place, perfect for fishermen and adventurers.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "cd307761-9699-4d84-9375-9bdc491e9398", "translation" => "La plage d’Ain Adjroud est un trésor naturel situé le long d'une route accidentée, accessible principalement en 4x4. Cette plage se distingue par ses galets et ses rochers, en faisant un lieu sauvage et préservé, non surveillé, idéal pour les pêcheurs et les aventuriers.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c66fc4bc-6456-4765-b8c0-773db12290da", "translation" => "شاطئ عين عجرود هو كنز طبيعي يقع على طول طريق وعرة، يمكن الوصول إليه بشكل رئيسي بواسطة مركبات 4x4. يتميز هذا الشاطئ بحصاه وصخوره، مما يجعله مكانًا بريًا ومحافظًا غير مراقب، مثالي لصيادي الأسماك والمغامرين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1712
            ["id" => "249de7cc-6184-4134-aa33-6f83df1119ab", "translation" => "The soft sand and clear sea invite you to bask in the sun or engage in water activities. Whether you're a swimming enthusiast or simply looking for a quiet place to relax, the Moscarda 2 beach offers ample space for everyone.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "450e05b9-874e-4d76-8ade-a401b4048a53", "translation" => "Le sable doux et la mer claire vous invitent à vous prélasser au soleil ou à vous adonner à des activités nautiques. Que vous soyez un passionné de baignade ou simplement à la recherche d'un lieu tranquille pour vous détendre, la plage Moscarda 2 offre un espace suffisant pour tous.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a054f42d-08c4-4e93-87c9-8541a1a4c828", "translation" => "الرمال الناعمة والبحر الصافي يدعوانك للاستلقاء تحت أشعة الشمس أو لممارسة أنشطة مائية. سواء كنت عاشقًا للسباحة أو مجرد بحثك عن مكان هادئ للاسترخاء، شاطئ موسكاردا 2 يوفر مساحة كافية للجميع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1713
            ["id" => "85286296-9723-41ff-81e1-37949887ee18", "translation" => "Located near the famous Moscarda Rock, which literally separates this beach from its twin sister Moscarda 2, it invites you to swim in its refreshing waters. This picturesque beach is surrounded by Aleppo pines, adding a touch of natural charm to its already enchanting setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f0c004e8-9856-4148-99ec-6b63d4abed1f", "translation" => "Située à proximité du célèbre rocher de Moscarda, qui divise littéralement cette plage de sa sœur jumelle Moscarda 2, elle vous invite à vous baigner dans ses eaux rafraîchissantes. Cette plage pittoresque est entourée de pins d'Alep, ajoutant une touche de charme naturel à son cadre déjà enchanteur.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c6acb918-6e36-4d0a-8039-bf6ca31ab116", "translation" => "يقع بالقرب من الصخرة المشهورة موسكاردا، والتي تفصل هذا الشاطئ عن شقيقته موسكاردا 2 تمامًا، وتدعوك للسباحة في مياهها المنعشة. يحيط بهذا الشاطئ الجميل أشجار الصنوبر الحلبي، مما يضيف لمسة من السحر الطبيعي إلى إطاره الساحر بالفعل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1714
            ["id" => "11e3c0bf-f2b8-40fc-9bb6-a2919aa4bec7", "translation" => "The fishing port of Marsa Ben M'hidi is a bustling and essential hub for fishing activity in the region. This port serves as the central point where local fishermen land with their fresh catches, which often include a wide variety of fish.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "32813216-47f6-4071-8ec0-1d70a89622b6", "translation" => "Le port de pêche de Marsa Ben M'hidi est un endroit animé et essentiel pour l'activité de pêche dans la région. Ce port est le point central où les pêcheurs locaux débarquent avec leurs prises fraîches, qui incluent souvent une grande variété de poissons.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7943a907-a40a-4af3-99d7-3acec313ee89", "translation" => "ميناء صيد مرسى بن مهيدي هو مكان حيوي وأساسي لنشاط الصيد في المنطقة. يعتبر هذا الميناء النقطة المركزية حيث يقوم الصيادون المحليون بالانزال بصيدهم الطازج، الذي يتضمن في العادة مجموعة واسعة من أنواع الأسماك.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1715
            ["id" => "95742d54-96b2-4a00-b5eb-bd02afccb132", "translation" => "On this beach, visitors can enjoy playground areas for children, as well as rental services for paddle boats, windsurfing boards, and jet-skis for a day of fun at sea.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "434d4186-b579-4b92-8ec7-882cba6fa577", "translation" => "Sur cette plage, les visiteurs peuvent profiter d'aires de jeux pour les enfants, ainsi que de services de location de pédalos, de planches à voile et de jet-skis pour une journée d'amusement en mer.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "8ec9a3a9-9653-4996-9f0b-2935cd881e2e", "translation" => "على هذا الشاطئ، يمكن للزوار الاستمتاع بمناطق لعب للأطفال، بالإضافة إلى خدمات تأجير قوارب الدفع بالدواسات ولوحات الرياح والجت سكي لقضاء يوم ممتع على البحر.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1716
            ["id" => "14f798ea-7a64-486f-807a-6194b389de47", "translation" => "Bab el Khemis is an iconic place in Tlemcen, a silent witness of centuries past. It invites you to discover the hidden treasures of this fascinating city, where every corner holds a unique story and beauty.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3c6efca2-3824-4807-8462-61baa711b8b0", "translation" => "Bab el Khemis est un lieu emblématique de Tlemcen, un témoin silencieux des siècles passés. Elle vous invite à découvrir les trésors cachés de cette ville fascinante, où chaque coin recèle une histoire et une beauté uniques.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6bdd187d-f00e-41b3-bca9-5fc7c26ed8bc", "translation" => "باب الخميس هو مكان رمزي في تلمسان، شاهد صامت على القرون الماضية. إنه يدعوك لاكتشاف كنوز هذه المدينة الرائعة، حيث يخفي كل زاوية فيها قصة وجمال فريدين.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1717
            ["id" => "0f97e621-61d4-41a7-bb78-8bdf64ee779e", "translation" => "Whether you're passionate about art, culture, or simply curious to learn more about Islamic calligraphy, this museum is a must-visit in Tlemcen. Come and explore this captivating world of words and images that transcends borders and languages, and discover the beauty of Islamic calligraphy in all its splendor.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "8e06f9a0-df65-4ade-9aa9-c0a2c36fd41d", "translation" => "Que vous soyez passionné par l'art, la culture ou simplement curieux d'en apprendre davantage sur la calligraphie islamique, ce musée est un lieu incontournable à Tlemcen. Venez explorer cet univers captivant de mots et d'images qui transcende les frontières et les langues, et découvrez la beauté de la calligraphie islamique dans toute sa splendeur.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "58440ba2-b781-4a36-b3a2-6847d4e3268c", "translation" => "سواء كنت متحمسًا للفن أو الثقافة، أو مجرد فضولي للمزيد عن الخط الإسلامي، فإن هذا المتحف هو وجهة لا بد منها في تلمسان. تعال واستكشف هذا العالم المثير من الكلمات والصور الذي يتجاوز الحدود واللغات، واكتشف جمال الخط الإسلامي بكل روعته.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1718
            ["id" => "7c5b57dd-5211-4139-870a-4982733d147c", "translation" => "The statue is a realistic representation of Ben Bella, capturing his expression and posture in an impressive manner. This work is an imposing tribute to one of the most significant figures in the history of modern Algeria.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "1d3a4f49-3bb7-4d93-9b09-1650a9b80daf", "translation" => "La statue est une représentation réaliste de Ben Bella, capturant son expression et sa posture d'une manière impressionnante. Cette œuvre est un hommage imposant à l'une des figures les plus importantes de l'histoire de l'Algérie moderne.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b294d602-4fb9-4937-9052-8e5cda92d198", "translation" => "التمثال هو تمثيل واقعي لبن بلة، حيث يلتقط تعبيره ووضعيته بطريقة مذهلة. هذا العمل هو تكريم مهيب لواحد من أهم الشخصيات في تاريخ الجزائر الحديث.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1719
            ["id" => "886516c8-2bcb-4e06-b9ae-b1b2a4d2334d", "translation" => "The Aqua Center is a recommended destination for those looking to relax, have fun in the water, and enjoy delicious pizzas in a friendly atmosphere.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c911ad00-b2ca-4c12-8fc2-3c29e195d979", "translation" => "L'Aqua Center est une destination recommandée pour ceux qui cherchent à se détendre, à s'amuser dans l'eau et à déguster de bonnes pizzas dans une atmosphère conviviale.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b7a7bac3-c0ea-4b2a-9a66-a684103cdf1b", "translation" => "أكوا سنتر هو وجهة موصى بها لأولئك الذين يبحثون عن الاسترخاء والمرح في الماء والاستمتاع ببيتزا لذيذة في جو ودود.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1720
            ["id" => "e1a44f35-67c9-4d3e-b45f-03c939d624e8", "translation" => "Whether you're a history enthusiast, a fan of Islamic architecture, or just a curious traveler, the minaret of the old Agadir mosque offers a unique experience. Let yourself be captivated by the beauty of this historic structure and its essential role in the cultural heritage of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "573ad60b-27a2-405b-8353-01ebf8655342", "translation" => "Que vous soyez un passionné d'histoire, un amateur d'architecture islamique ou simplement un voyageur curieux, le minaret de l'ancienne mosquée d'Agadir vous offre une expérience unique. Laissez-vous séduire par la beauté de cet édifice historique et son rôle essentiel dans le patrimoine culturel de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "89d932bb-7679-4e18-9572-d1a213abba71", "translation" => "سواء كنت عاشقًا للتاريخ، أو عاشقًا للعمارة الإسلامية، أو مجرد مسافر فضولي، فإن مئذنة المسجد القديم أغادير تقدم لك تجربة فريدة. اسحب نفسك في جمال هذا الهيكل التاريخي ودوره الأساسي في التراث الثقافي للمنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1721
            ["id" => "3e5aaec8-5bb7-4bc6-8484-7f52502eea30", "translation" => "La Marguerite equestrian center is more than just a riding school; it's a timeless oasis. Its warm and welcoming team offers you a unique experience you won't find anywhere else. It's a beautiful place where you can learn about horse riding, explore the world of equestrian tourism, and create unforgettable memories in the company of these noble creatures.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "ad1155fb-24d3-45cf-abf1-89100f9b8a17", "translation" => "Le centre équestre La Marguerite est bien plus qu'une simple école d'équitation, c'est une véritable oasis hors du temps. Son équipe chaleureuse et accueillante vous offre une expérience unique que vous ne trouverez nulle part ailleurs. C'est un lieu magnifique où vous pourrez vous initier à l'équitation, explorer le monde du tourisme équestre, et vivre des moments inoubliables en compagnie de ces nobles créatures.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "6e50b444-d5d8-4d5b-af85-21d16a4ded8b", "translation" => "نادي الفروسية لا مارغريت هو أكثر من مجرد مدرسة لتعلم الفروسية، إنها واحة خالدة في الزمن. فريقه الودود والمرحب يقدم لك تجربة فريدة لن تجدها في أي مكان آخر. إنه مكان جميل حيث يمكنك تعلم ركوب الخيل، استكشاف عالم السياحة الفروسية، وخلق ذكريات لا تُنسى بصحبة هذه المخلوقات النبيلة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1722
            ["id" => "02f715a0-b155-44fc-b9e8-bf2edd2e7684", "translation" => "The Arts and Exhibition Center is the premier venue for hosting cultural, artistic, scientific exhibitions and for organizing conferences, workshops, and various cultural activities. It's a dynamic space where creativity and knowledge-sharing come together.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "012566b3-e4cd-4fcd-a9c5-a4f3ebc4f311", "translation" => "Le centre des arts et des expositions est le lieu par excellence pour la tenue de salons et expositions culturelles, artistiques, scientifiques, ainsi que pour l'organisation de colloques, journées d'études et diverses activités culturelles. C'est un espace dynamique où la créativité et le partage de connaissances se rencontrent.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c7b64183-5cc7-4443-888b-460d606a2136", "translation" => "مركز الفنون والمعارض هو المكان الرئيسي لاستضافة المعارض الثقافية والفنية والعلمية، وأيضًا لتنظيم المؤتمرات والندوات ومجموعة متنوعة من الأنشطة الثقافية. إنه مساحة ديناميكية حيث تلتقي الإبداع ومشاركة المعرفة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1723
            ["id" => "7044c7d8-485f-40ae-9521-bcb979fd0a0d", "translation" => "Whether you're a botany enthusiast or just looking for a relaxing spot in the heart of the city, the King Jugurtha's garden will meet your expectations. A visit to this garden will allow you to escape the fast pace of daily life and rejuvenate amidst nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7a669aba-fc2d-48a4-bd3d-6f234ca93662", "translation" => "Que vous soyez un amateur de botanique ou simplement à la recherche d'un lieu de détente au cœur de la ville, le jardin du Roi Jugurtha saura combler vos attentes. Une visite dans ce jardin vous permettra de vous échapper du rythme effréné de la vie quotidienne et de vous ressourcer au contact de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "dc0d65ab-f482-4037-9b92-c99ca131b7c4", "translation" => "سواء كنت عاشقًا لعلم النبات أم مجرد بحثك عن مكان للاسترخاء في قلب المدينة، سترضيك حديقة الملك يوغرطة. زيارة هذه الحديقة ستسمح لك بالهروب من وتيرة الحياة اليومية السريعة وتجديد نشاطك بجوار الطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1724
            ["id" => "f705dcd1-fce8-49ab-a39f-f3bcaa151a83", "translation" => "The Chamber of crafts and trades of Tlemcen is a place dedicated to the preservation and promotion of traditional crafts in the region. It is a space where craftsmanship in all its forms is celebrated and valued.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "5852958d-0db6-4916-bcad-707e1723c6f4", "translation" => "La chambre de l'artisanat et des métiers de Tlemcen est un lieu dédié à la préservation et à la promotion des métiers artisanaux traditionnels de la région. C'est un espace où l'artisanat, sous toutes ses formes, est célébré et valorisé.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b9af038f-4a33-487d-8473-76f516cfe4b7", "translation" => "غرفة الصناعات والحرف في تلمسان مكان مخصص للحفاظ على وتعزيز الحرف التقليدية في المنطقة. إنها مساحة حيث يُحتفى ويُقدر الحرف بكل أشكاله.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1725
            ["id" => "7da08993-facd-40f9-84c7-c287e318e2ab", "translation" => "The magnificent Sidi Boumediene mosque, nestled in the el Eubbad district, is much more than a religious building. Built in 1339 by the prestigious Marinid sultan Abou l'Hassan Ali, this mosque is the central jewel of a historical complex.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "40bc3443-487a-47b4-adc1-101bc13849ca", "translation" => "La magnifique mosquée Sidi Boumediene, nichée dans le quartier el Eubbad est bien plus qu'un édifice religieux. Érigée en 1339 par le prestigieux sultan mérinide Abou l'Hassan Ali, cette mosquée est le joyau central d'un complexe historique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "5f8e4a07-89a7-4da4-a12c-deb64a3e4022", "translation" => "مسجد سيدي بومدين الرائع، المدفون في حي العباد بالقرب من المدينة، هو أكثر من مبنى ديني. تم بناؤه في عام 1339 على يد السلطان المريني أبو الحسن علي، وهذا المسجد هو الجوهرة المركزية لمجمع تاريخي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1726
            ["id" => "417fb72a-19d7-4416-953e-cabfa762a452", "translation" => "Visiting the exterior of this church provides insight into the architecture of the era and its role in the life of the local community. History and heritage enthusiasts will certainly appreciate the opportunity to get up close to this historic building, even though it is currently not open to the public. While the mujahid museum is inaccessible at the moment, exploring the church itself can be a meaningful experience for those interested in the history of the Remchi region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "c29f1a11-dc19-4bf9-9d20-dbe7ff0b9cd8", "translation" => "La visite de l'extérieur de cette église offre un aperçu de l'architecture de l'époque et de son rôle dans la vie de la communauté locale. Les amateurs d'histoire et de patrimoine apprécieront certainement l'occasion de voir de près cet édifice historique, même s'il n'est pas actuellement ouvert au public. Bien que le musée du Moudjahid soit inaccessible pour le moment, l'exploration de l'église elle-même peut être une expérience significative pour ceux qui s'intéressent à l'histoire de la région de Remchi.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "a760e351-b5d3-480a-8000-db360b29ac68", "translation" => "زيارة الخارج لهذه الكنيسة تقدم نظرة على عمارة العصر ودورها في حياة المجتمع المحلي. سيقدر عشاق التاريخ والتراث بالتأكيد الفرصة للتواصل الوثيق مع هذا المبنى التاريخي، حتى وإن لم يتم فتحه حاليًا للجمهور. على الرغم من عدم إمكانية دخول متحف المجاهد في الوقت الحالي، إلا أن استكشاف الكنيسة نفسها يمكن أن يكون تجربة ذات مغزى بالنسبة لأولئك الذين يهتمون بتاريخ منطقة الرمشي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1727
            ["id" => "c580dcd4-e664-462e-b875-bea3da01f7f6", "translation" => "The Tlemcen national park is a natural and cultural treasure. With its forests, waterfalls, cliffs, archaeological sites, and spelunking opportunities, this park provides a unique experience for nature and history enthusiasts. A visit here allows you to explore the natural beauty of the region and immerse yourself in its rich cultural heritage. A must-visit destination during your stay in Tlemcen.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "13bf80d7-a89c-4aab-ad4b-b45cbef979ec", "translation" => "Le parc national de Tlemcen est un trésor naturel et culturel. Avec ses forêts, cascades, falaises, sites archéologiques et spéléologiques, ce parc offre une expérience unique pour les amoureux de la nature et de l'histoire. Une visite ici vous permettra de découvrir la beauté naturelle de la région et de plonger dans son riche patrimoine culturel. Un endroit à ne pas manquer lors de votre séjour à Tlemcen.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "14dde1fa-1258-44e6-b1a7-ca57426036af", "translation" => "الحظيرة الوطنية تلمسان هو كنز طبيعي وثقافي. بغاباتها وشلالاتها ومنحدراتها ومواقعها الأثرية والتسلق في الكهوف، تقدم هذه الحظيرة تجربة فريدة لعشاق الطبيعة والتاريخ. زيارة هنا تمنحك فرصة استكشاف الجمال الطبيعي للمنطقة والانغماس في تراثها الثقافي الغني. مكان لا بد من زيارته خلال إقامتك في تلمسان.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1728
            ["id" => "4300b814-5b88-4a05-801e-368d3995315b", "translation" => "Whether you're seeking peace and serenity or outdoor adventure, the Sekkak dam is the perfect place to rejuvenate and enjoy the natural beauty of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7f5ba715-e19a-48cb-bc3d-18f9e8158827", "translation" => "Que vous soyez en quête de calme et de sérénité ou d'aventure en plein air, le barrage Sekkak est l'endroit parfait pour vous ressourcer et profiter de la beauté naturelle de la région.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b23dffd9-324a-4e20-8532-f1599caaab73", "translation" => "سواء كنت تبحث عن السكينة والهدوء أو عن المغامرة في الهواء الطلق، فسد سكاك هو المكان المثالي للاسترخاء والاستمتاع بجمال الطبيعة في المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1729
            ["id" => "07d4aad7-b2e3-4351-bff9-ed290b083c20", "translation" => "Surrounded by picturesque landscapes, this dam provides a perfect getaway for nature lovers and outdoor enthusiasts. With its tranquil waters, it's an ideal spot for fishing and waterfront relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "244795ae-b708-4108-a422-5b4c7dca553c", "translation" => "Entouré de paysages pittoresques, ce barrage offre une escapade parfaite pour les amoureux de la nature et les amateurs de plein air. Avec ses eaux paisibles, c'est un endroit idéal pour la pêche et la détente au bord de l'eau.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "45e73012-0da1-4f14-b707-b39b83cd7df5", "translation" => "محاطًا بمناظر خلابة، يقدم هذا السد منفذًا مثاليًا لعشاق الطبيعة وعشاق الأنشطة في الهواء الطلق. بمياهه الهادئة، إنه مكان مثالي لصيد الأسماك والاسترخاء على ضفاف الماء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1730
            ["id" => "699728de-a991-4268-afce-2a47bed24492", "translation" => "It's a meeting place for the local residents, where one can enjoy nature right in the heart of the city. Come to rejuvenate and relish the beauty of this public garden during your stay in Maghnia.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "7976c5ac-0c71-49d5-a30f-f421b0f55ad7", "translation" => "C'est un lieu de rencontre pour les habitants des environs, où l'on peut profiter de la nature en plein cœur de la ville. Venez vous ressourcer et profiter de la beauté de ce jardin public lors de votre séjour à Maghnia.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "66d3f62d-8411-426d-986d-806c751cda70", "translation" => "إنه مكان للقاء سكان المنطقة، حيث يمكن للشخص الاستمتاع بالطبيعة في قلب المدينة. تعال لتجديد نشاطك وتذوق جمال هذه الحديقة العامة خلال إقامتك في مغنية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1731
            ["id" => "c23203a5-fd33-4363-92ae-82677fd55d5f", "translation" => "The monument to the martyrs of Maghnia is an iconic place that pays tribute to the heroes and victims of the Algerian war of independence. It is an imposing and solemn monument, located in the heart of the city, that reminds of the courage and determination of the Algerian people in their struggle for freedom.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "f1b63f83-f093-4ce5-8d37-15970d328908", "translation" => "Le monument aux martyrs de Maghnia est un lieu emblématique qui rend hommage aux héros et aux victimes de la guerre pour l'indépendance de l'Algérie. C'est un monument imposant et solennel, situé au cœur de la ville qui rappelle le courage et la détermination du peuple algérien dans sa lutte pour la liberté.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "9dbd0ad0-f99a-4e3b-ab70-35abb8878ba0", "translation" => "نصب الشهداء في مغنية هو مكان رمزي يكرم الأبطال وضحايا حرب استقلال الجزائر. إنه نصب مهيب ورسمي، يقع في قلب المدينة، يذكر بشجاعة وعزيمة الشعب الجزائري في صراعه من أجل الحرية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1732
            ["id" => "03a39217-2d43-44ad-831d-1dcbb7b754a7", "translation" => "Whether you're an outdoor enthusiast or simply seeking tranquility, the Boughrara dam is the perfect place to escape the hustle and bustle of daily life and immerse yourself in the splendor of nature. Come and discover it for yourself, and be captivated by its unique charm.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d81d684d-2f03-482e-bb79-126ef950d618", "translation" => "Que vous soyez un passionné de plein air ou simplement en quête de tranquillité, le barrage de Boughrara est l'endroit idéal pour échapper au tumulte de la vie quotidienne et vous immerger dans la splendeur de la nature. Venez le découvrir par vous-même et laissez-vous séduire par son charme unique.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "abeb8b6c-175a-48c3-9704-e330f28483ee", "translation" => "سواء كنت عاشقًا للأنشطة في الهواء الطلق أم كنت ببساطة تبحث عن السكينة، سد بوغرارة هو المكان المثالي للهروب من صخب الحياة اليومية والانغماس في روعة الطبيعة. تعال واكتشفه بنفسك واترك نفسك تسحر بسحره الفريد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1733
            ["id" => "0412a20f-0423-4839-ad84-cd59e6f97765", "translation" => "The Boughrara thermal resort is a peaceful retreat, perfect for rejuvenation and relaxation. Nestled in a tranquil setting, it provides a warm welcome and satisfying thermal facilities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3aa7b3ca-be85-471b-a918-2361530e9180", "translation" => "La station thermale de Boughrara est une retraite paisible, parfaite pour se ressourcer et se détendre. Nichée dans un cadre tranquille, elle offre un accueil chaleureux et des installations thermales satisfaisantes.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "23109134-a133-4743-a958-30819477da69", "translation" => "منتجع بوغرارة هو منتجع هادئ، مثالي للتجديد والاسترخاء. يوجد في إطار هادئ ويقدم استقبالًا دافئًا ومرافق حرارية مرضية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1734
            ["id" => "327ce36b-80dd-4904-9e01-0164c5e6e534", "translation" => "Hammam Chiguer is an ancient thermal spa with remarkable medicinal properties, although it has been neglected in recent years. Its water is known for its health benefits, especially for the treatment of kidney stones.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "a91dbac0-58a8-450d-9a2f-561748cd5c9f", "translation" => "Hammam Chiguer est une ancienne station thermale aux propriétés médicinales remarquables, bien que négligée ces dernières années. Son eau est reconnue pour ses bienfaits sur la santé, en particulier pour le traitement des calculs rénaux.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "da540484-8e2f-4986-9cb2-95ff064712dd", "translation" => "حمّام شيقر هو منتجع حراري قديم يتمتع بخصائص طبية ملحوظة، على الرغم من إهماله في السنوات الأخيرة. تُعرف مياهه بفوائدها الصحية، خاصة لعلاج حصوات الكلى.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1735
            ["id" => "80af316e-4cb3-4adf-b45c-c99b99e70c9b", "translation" => "It's an ideal place for a peaceful nature getaway, whether you're a fishing enthusiast, a family picnicker, or simply seeking a moment of serenity by the water.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "0b0ea843-215f-48bb-aa4e-f18a0490b7f2", "translation" => "C'est un lieu idéal pour une escapade tranquille en pleine nature, que vous soyez amateur de pêche, de pique-nique en famille ou tout simplement en quête d'un moment de sérénité au bord de l'eau.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "b7b875b5-cc1b-4ee4-a748-beafb3b8457c", "translation" => "إنه المكان المثالي للهروب إلى الطبيعة الهادئة، سواء كنت عاشقًا لصيد الأسماك أو لنزهة العائلة، أو ببساطة بحثًا عن لحظة من السكينة على ضفاف الماء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1736
            ["id" => "16147f9a-f144-46a0-9804-21b4610c1f87", "translation" => "The remnants of the Ghar Rouban fortification are a captivating mystery that transports you into the past. Although information about this fortification is scarce, its strategic location makes it an intriguing historical site of interest. Visitors can explore the ruins of this ancient structure and envision the history that unfolded there.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "b53dc331-ae9d-41e9-8121-8b4a5c829cac", "translation" => "Les vestiges de la fortification de Ghar Rouban sont un mystère captivant qui vous transporte dans le passé. Bien que les informations sur cette fortification soient rares, son emplacement stratégique en fait un site d'intérêt historique intrigant. Les visiteurs peuvent explorer les ruines de cette ancienne structure et imaginer l'histoire qui s'y est déroulée. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "70edd734-ef86-4d5d-984a-278687ef4d7c", "translation" => "بقايا تحصين غار روبان هي لغز مثير ينقلك إلى الماضي. على الرغم من ندرة المعلومات حول هذا التحصين، إلا أن موقعه الاستراتيجي يجعله موقعًا تاريخيًا مثيرًا للاهتمام. يمكن للزوار استكشاف أطلال هذا الهيكل القديم وتخيل التاريخ الذي جرى فيه.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1737
            ["id" => "245f328d-7771-414f-abe6-f68a2e384817", "translation" => "Surrounded by breathtaking landscapes, this dam is much more than a mere hydraulic structure; it's a place where nature and technology come together to create a breathtaking spectacle.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "62559f0d-7b49-4eb8-8090-dd56b04e030a", "translation" => "Entouré de paysages à couper le souffle, ce barrage est bien plus qu'une simple structure hydraulique ; c'est un endroit où la nature et la technologie se rejoignent pour créer un spectacle à couper le souffle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "0317e1c1-3db6-4c4f-b6d9-18437831caa4", "translation" => "محاط بمناظر خلابة، هذا السد هو أكثر من مجرد هيكل مائي؛ إنه مكان حيث تتلاقى الطبيعة والتكنولوجيا لخلق منظر رائع يأسر الألباب.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1738
            ["id" => "ac0eeee6-3c2e-49f6-b2b0-de147a3d772b", "translation" => "The Maghnia Art Gallery is an exceptional cultural venue housed in a former church dating back to the colonial era. This unique place offers visitors an enriching artistic experience in the heart of the city. It's an ideal spot for art and culture enthusiasts looking to explore and appreciate Algerian creativity in an exceptional historical setting.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "486894f8-ebb1-4c8c-8328-754c004e176d", "translation" => "La galerie d'art de Maghnia est un lieu culturel exceptionnel abrité dans une ancienne église datant de l'époque coloniale. Ce lieu unique offre aux visiteurs une expérience artistique enrichissante au cœur de la ville. C'est un endroit idéal pour les amateurs d'art et de culture qui souhaitent découvrir et apprécier la créativité algérienne dans un cadre historique exceptionnel.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d0459ade-ed01-44f6-ab51-68d103b3cd44", "translation" => "معرض مغنية للفن هو مكان ثقافي استثنائي موجود في كنيسة سابقة تعود إلى العهد الاستعماري. هذا المكان الفريد يقدم للزوار تجربة فنية غنية في قلب المدينة. إنه المكان المثالي لهواة الفن والثقافة الذين يرغبون في استكشاف وتقدير الإبداع الجزائري في إعداد تاريخي استثنائي.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1739
            ["id" => "69473775-d417-4517-bd00-e2abf07cc824", "translation" => "Also known as Kahina, this statue pays tribute to an iconic historical figure of Berber resistance against the Arab conquests in the 7th century.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "955d148a-4897-4af5-a0c5-1b9ffc928eba", "translation" => "Également connue sous le nom de Kahina. Cette statue rend hommage à une figure historique emblématique de la résistance berbère contre les conquêtes arabes au VIIe siècle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "e255e9ce-654c-4f9b-9cb4-af9c7854fa64", "translation" => "تُعرف أيضًا بلقب كاهينة. يكرم هذا التمثال شخصية تاريخية رمزية في مقاومة الأمازيغ ضد الغزو العربي في القرن السابع.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1740
            ["id" => "9cd8214c-5c87-479d-b1ad-5d962202e2cb", "translation" => "The public garden of Mohammadia is a green and peaceful space in the heart of the city. It provides a tranquil setting for relaxation, strolling, and enjoying nature.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "2059131d-131f-4be6-8c05-4b7aac02c202", "translation" => "Le jardin public de Mohammadia est un espace verdoyant et apaisant au cœur de la ville. Il offre un cadre paisible pour se détendre, se promener et profiter de la nature.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "d5a2788c-d772-4c3b-b42d-ac354f993160", "translation" => "حديقة المحمدية العامة هي مساحة خضراء هادئة ومريحة في قلب المدينة. توفر بيئة هادئة للاسترخاء، والتجول، والاستمتاع بالطبيعة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1741
            ["id" => "f56ec4f5-a60b-4e7f-8a40-f69ef8d5024d", "translation" => "Bab Boubarnous is an iconic gate that once served as the entrance point to the fortress. It stands majestically, revealing an architecture that bears witness to the rich history of the region.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "aeee5d3d-0e1d-46cd-a169-66e9ead3cdb0", "translation" => "Bab Boubarnous est une porte emblématique qui servait autrefois de point d'entrée à la forteresse. Elle se dresse majestueusement, révélant une architecture qui témoigne du riche passé de la région. ", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "1c2b73e0-6b86-4ccb-a318-392d584283a6", "translation" => "باب بوبرنوس هو بوابة رمزية كانت في الماضي تستخدم كنقطة دخول إلى القلعة. تقف بكرامة، مكشوفة بمعمار يشهد على ماضٍ غني من المنطقة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1742
            ["id" => "75706827-afa9-483f-be7f-1ed546e864b6", "translation" => "The Boukhtouta Hocine garden is a welcoming and well-maintained green space, providing visitors with a natural environment conducive to relaxation, strolls, and recreational activities.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "6487b9f7-d405-4285-b8c4-2cd04c89dee2", "translation" => "Le jardin Boukhtouta Hocine est un espace vert accueillant et bien entretenu, offrant aux visiteurs un environnement naturel propice à la détente, à la promenade et aux activités récréatives.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "941d108f-2c7e-463b-a838-2f36f65721da", "translation" => "حديقة بوخطوطة حسين هي مساحة خضراء مرحبة ومُحافظ عليها بشكل جيد، توفر للزوار بيئة طبيعية تُشجع على الاسترخاء والنزهات والأنشطة الترفيهية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1743
            ["id" => "b0a7bc01-3e80-4968-99a3-650cea510ee2", "translation" => "The statue of Zighoud Youcef is an imposing and symbolic representation of this historical leader. This artistic work also serves as a constant reminder of the sacrifices made for freedom and the precious legacy left by the martyr.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "28ebed78-b9de-4479-a607-cce8e965d4b6", "translation" => "La statue de Zighoud Youcef est une représentation imposante et symbolique de ce leader historique. Cette œuvre artistique sert également de rappel constant des sacrifices consentis pour la liberté et de l'héritage précieux laissé par le martyr.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "7d0c248d-b29d-47e9-96db-2e65b19401da", "translation" => "تمثال زيغود يوسف هو تجسيد مهيب ورمزي لهذا الزعيم التاريخي. هذا العمل الفني يعتبر أيضًا تذكيرًا دائمًا بالتضحيات التي تمت من أجل الحرية والتراث الثمين الذي تركه الشهيد.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1744
            ["id" => "53878a92-3f9c-4c59-81d2-a689c7d83fae", "translation" => "The statue of Maatoub Lounes is a remarkable work dedicated to this Kabyle artist and activist. Strategically placed in the city, the statue captures the bold spirit and legacy of this cultural figure.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "081b796c-35f4-40b3-b585-8e1a855ac6de", "translation" => "La statue de Maatoub Lounes est une œuvre remarquable dédiée à cet artiste et militant kabyle. Placée stratégiquement dans la ville, la statue capture l'esprit audacieux et l'héritage de cette figure culturelle.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "323dc888-564c-44ee-9725-fce7180432a5", "translation" => "تمثال معطوب لوناس هو عمل رائع مكرس لهذا الفنان والناشط القبائلي. وضعت بشكل استراتيجي في المدينة، يلتقط التمثال الروح الجريئة والتراث الثقافي لهذه الشخصية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1745
            ["id" => "976b58ee-7d37-4d94-a67e-a5f00162cd48", "translation" => "The Thais beach is a little marvel, characterized by crystal-clear and clean waters. Belonging to the Thaïs Inn, it offers an exclusive experience even if you are not staying at the inn.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "980f5ff4-f4b1-4da1-aec8-68d1bedadd36", "translation" => "La plage Thaïs est une petite merveille, caractérisée par des eaux cristallines et propres. Appartenant à l'auberge Thaïs, elle offre une expérience exclusive même si vous ne séjournez pas à l'auberge.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "33d932b5-9996-4ef1-b0f7-6a6e588ded63", "translation" => "شاطئ طاييس هو أعجوبة صغيرة, مميزة بمياهها صافية ونقية. يعود ملكيته إلى نزل طاييس, مما يوفر تجربة حصرية حتى إذا لم تكن تقيم في النزل.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1746
            ["id" => "20611113-a6c6-4e92-8390-43caf77c9eb7", "translation" => "Generally well-maintained, this garden serves as a natural refuge amid urban hustle, a place where residents can enjoy moments of tranquility.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "70e0cb20-704f-47de-8c1f-750e39b22d54", "translation" => "Généralement entretenu avec soin, ce jardin constitue un refuge naturel au sein de l'agitation urbaine, un endroit où les résidents peuvent profiter de moments de tranquillité.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "c8913e8b-abb3-4da5-86b0-0b0f0d12daec", "translation" => "عادةً ما يتم الاعتناء به , تشكل هذه الحديقة ملاذًا طبيعيًا في قلب الحياة الحضرية، مكانًا حيث يمكن للسكان الاستمتاع بلحظات الهدوء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1747
            ["id" => "e0fbf7f9-694c-46e9-8d67-80f0202a7658", "translation" => "This garden is of modest size but provides a peaceful and welcoming atmosphere. It is landscaped with colorful flower beds, shrubs, and trees that create a pleasant setting for relaxation.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "d08bfcca-5ebe-4a28-b68a-ebadab56496f", "translation" => "Ce jardin est de taille modeste mais offre une atmosphère paisible et accueillante. Il est aménagé avec des parterres de fleurs colorées, des arbustes et des arbres qui créent un cadre agréable pour se détendre.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "fdb50fab-4536-4bae-b5d8-b56585121a7c", "translation" => "هذه الحديقة صغيرة الحجم ولكنها توفر جوًا هادئًا ومرحبًا. تم تنسيقها مع مرتبات من الزهور الملونة، وأشجار وشجيرات تخلق بيئة مريحة للاسترخاء.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1748
            ["id" => "6d965a14-a0b2-4ea5-b8c5-3ae52b8c3744", "translation" => "This structure was originally built as a church by the French occupation, bearing the name Saint Joseph, until 1974, marking its conversion into a Muslim place of worship.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "e12349b5-9366-4584-969f-1ed40faf9130", "translation" => "Cet édifice était à l'origine construit comme une église par l'occupation française, portant le nom de Saint Joseph, jusqu'à l'année 1974, date marquant sa conversion en lieu de culte musulman.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "bc91d168-205f-4273-a55c-1892cbbc4544", "translation" => "كان هذا المبنى في الأصل مبنيًا ككنيسة من قبل الاحتلال الفرنسي، تحمل اسم القديس جوزيف، حتى عام 1974، الذي شهد تحوله إلى مكان للعبادة الإسلامية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1749
            ["id" => "7cf280a9-ee51-49f0-b6a7-bdce786cea52", "translation" => "The Riadh el Feth open-air theater transcends the simple concept of a venue for artistic performances. It becomes a hub of cultural convergence, where the surrounding nature harmoniously blends with human creativity. It is a place where art enthusiasts can come together to experience memorable moments at the intersection of nature and culture.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "eb724179-8a29-45ce-b3f1-ae69768d383b", "translation" => "Le théâtre de verdure de Riadh el Feth transcende le simple concept d'un lieu de représentation artistique. Il devient un lieu de convergence culturelle, où la nature environnante se marie harmonieusement avec la créativité humaine. C'est un endroit où les passionnés d'arts peuvent se réunir pour vivre des expériences mémorables au croisement de la nature et de la culture.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "58225400-b500-4b70-b1db-16ff46189619", "translation" => "مسرح الهواء الطلق برياض الفتح يتجاوز مفهوم بسيط لمكان الأداء الفني. إنه مكان حيث يمكن لعشاق الفن أن يجتمعوا ليعيشوا تجارب لا تُنسى عند تقاطع الطبيعة والثقافة.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            //1750
            ["id" => "3b1908e0-b99b-4ab8-81d4-27019c20ad77", "translation" => "The Cosmos cinema provides a unique cinematic experience in the heart of the city. Equipped with a modern screening room, it offers a diverse program ranging from local films to international productions.", "language_id" => "871d73c9-c65d-476a-97f0-929fff2707c3"],
            ["id" => "3c9dc9c3-40fa-4abb-9985-24f0506cdf86", "translation" => "Le cinéma Cosmos offre une expérience cinématographique unique au cœur de la ville. Doté d’une salle de projection moderne, il propose une programmation diversifiée, allant des films locaux aux productions internationales.", "language_id" => "0c5ba6c7-aa63-45f6-bc2b-abe7e0bcf27f"],
            ["id" => "76ffe7d9-d19d-4a21-a083-78bc1b880498", "translation" => "يقدم سينما كوزموس تجربة سينمائية فريدة في قلب المدينة. مزودًا بقاعة عرض حديثة، يقدم تشكيلة متنوعة من الأفلام، بدءًا من الأفلام المحلية وصولاً إلى الإنتاجات الدولية.", "language_id" => "29a02b6b-1e5e-4db9-bf25-ba362704fa73"],
            ];
        DB::table("translations")->insert($translations);
    }
}
